context:
[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Takamiyama Daigorō (髙見山 大五郎 , born 16 June 1944 as Jesse James Wailani Kuhaulua) is a former sumo wrestler, the first foreign born wrestler to win the top division championship (in 1972). His highest rank was "sekiwake". His active career spanned twenty years from 1964 to 1984, and he set a number of longevity records, including most tournaments ranked in the top "makuuchi" division, and most consecutive top division appearances. He is also the first foreign born wrestler ever to take charge of a training stable, founding Azumazeki stable in 1986. His most successful wrestler was fellow Hawaiian Akebono who reached the highest rank of "yokozuna" in 1993. He retired as a coach in 2009.', 'title': 'Takamiyama Daigorō'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Oliver Fricker is the second high-profile foreigner (after Michael P. Fay in 1994) to be sentenced to caning for vandalism in Singapore. On 25 June 2010, he was sentenced to five months' jail and three strokes of the cane under the Vandalism Act and Protected Areas and Protected Places Act. On appeal, the jail sentence was increased to seven months.", 'title': 'Oliver Fricker'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Michael Peter Fay (born May 30, 1975), better known simply as Michael Fay, is a United States citizen who was the subject of international attention in 1994 when he was sentenced to six strokes of the cane in Singapore for theft and vandalism at age 18. Although caning is a routine court sentence in Singapore, its barbarity caused controversy in the United States, and Fay's case was believed to be the first caning involving an American citizen. The number of cane strokes in Fay's sentence was ultimately reduced from six to four after United States officials requested leniency.", 'title': 'Michael P. Fay'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Caning is a widely used form of legal corporal punishment in Singapore. It can be divided into several contexts: judicial, prison, reformatory, military, school, and domestic or private. These practices of caning are largely a legacy of, and are influenced by, British colonial rule in Singapore. Similar forms of corporal punishment are also used in some other former British colonies, including two of Singapore's neighbouring countries, Malaysia and Brunei.", 'title': 'Caning in Singapore'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'As of 1 January 2017, there were 5,047,028 foreign nationals resident in Italy. This amounted to 8.2% of the country\'s population and represented an increase of 92,352 over the previous year. These figures include children born in Italy to foreign nationals (who were 75,067 in 2014; 14.9% of total births in Italy), but exclude foreign nationals who have subsequently acquired Italian nationality; this applied to 129,887 people in 2014. Around 6,2 million people residing in Italy have an immigration background (around the 10% of the country population). They also exclude illegal immigrants whose numbers are difficult to determine. In May 2008, "The Boston Globe" quoted an estimate of 670,000 for this group. The distribution of foreign born population is largely uneven in Italy: 59.5% of immigrants live in the northern part of the country (the most economically developed area), 25.4% in the central one, while only 15.1% live in the southern regions. The children born in Italy to foreign mothers were 102.000 in 2012, 99.000 in 2013 and 97.000 in 2014.', 'title': 'Immigration to Italy'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Foreign born (also non-native) people are those born outside of their country of residence. Foreign born are often non-citizens, but many are naturalized citizens of the country that they live in and others are citizens by descent, typically through a parent.', 'title': 'Foreign born'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Caning is used as a form of legal corporal punishment in Malaysia. It can be divided into at least three contexts: judicial/prison, school, and Sharia ("Syariah"). Of these three, the first two are largely a legacy of, and are influenced by, British colonial rule in the territories that are now part of Malaysia, particularly Malaya. Similar forms of corporal punishment are also used in some other former British colonies, including two of Malaysia\'s neighbouring countries, Singapore and Brunei.', 'title': 'Caning in Malaysia'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Caning is used as a form of judicial corporal punishment in Brunei. This practice is heavily influenced by Brunei's history as a British protectorate from 1888 to 1984. Similar forms of corporal punishment are also used in two of Brunei's neighbouring countries, Singapore and Malaysia, which are themselves former British colonies.", 'title': 'Caning in Brunei'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Singapore is an attractive destination due to its high living standards and wages. The punishment for illegal immigration in the country are a mandatory caning sentence of not less than 3 strokes and a prison sentence.', 'title': 'Illegal immigration to Singapore'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Misuse of Drugs Act is a drug control law in Singapore classifying substances into three categories, Classes A, B, and C. Section 44 provides that "The Minister may, by an order published in the Gazette" add, remove, or transfer drugs among the classes. The statute\'s penal provisions are draconian by most nations\' standards, providing for long terms of imprisonment, caning, and capital punishment. The law creates a presumption of trafficking for certain threshold amounts, e.g. 30\xa0grams of cannabis. It also creates a presumption that a person possesses drugs if he possesses the keys to a premises containing the drugs, and that "Any person found in or escaping from any place or premises which is proved or presumed to be used for the purpose of smoking or administering a controlled drug shall, until the contrary is proved, be presumed to have been smoking or administering a controlled drug in that place or premises." Thus, one runs the risk of arrest for drug use by simply being in the company of drug users. The law also allows officers to search premises and individuals, without a search warrant, if he "reasonably suspects that there is to be found a controlled drug or article liable to seizure". Moreover, Section 31 allows officers to demand urinalysis of suspected drug offenders.', 'title': 'Misuse of Drugs Act (Singapore)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Dorian Gray is the main character in Oscar Wilde's novel The Picture of Dorian Gray. Dorian Gray is a handsome, susceptible, wealthy young Victorian gentleman. He falls in love with and devotes himself to Sibyl Vane. Dorian has two friends, Basil and Henry. Basil is an artist who draws a portrait of Dorian that emphasizes his youthful, noble, and natural beauty. Henry is a friend who has a cynical nature and who shares various thoughts with Dorian.", 'title': 'Dorian Gray (character)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Dorian Gray is the main character of the novel "The Picture of Dorian Gray" (1890) by Oscar Wilde.', 'title': 'Dorian Gray (disambiguation)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Picture of Dorian Gray (1910), a.k.a. Dorian Grays Portræt, is a Danish silent film based on the novel "The Picture of Dorian Gray" by Oscar Wilde.', 'title': 'The Picture of Dorian Gray (1910 film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Picture of Dorian Gray is a 1945 American horror-drama film based on Oscar Wilde's 1890 novel of the same name. Released in March 1945 by Metro-Goldwyn-Mayer, the film is directed by Albert Lewin and stars George Sanders as Lord Henry Wotton and Hurd Hatfield as Dorian Gray. Shot primarily in black-and-white, the film features four inserts in 3-strip Technicolor of Dorian's portrait as a special effect (the first two of his portrait's original state, and the second two after a major period of degeneration).", 'title': 'The Picture of Dorian Gray (1945 film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'A Portrait of Dorian Gray (2005) is the fashion designer and photographer Karl Lagerfeld\'s rendition of Oscar Wilde\'s novel "The Picture of Dorian Gray" (1891) in photography. The models, Larry Scott and Eva Herzigová, star as Mr. and Mrs. Dorian Gray.', 'title': 'A Portrait of Dorian Gray'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Picture of Dorian Gray ("El retrato de Dorian Gray"), is a Mexican telenovela, based on "The Picture of Dorian Gray", the novel written by Oscar Wilde. The main character is the handsome young man called Dorian Gray (played by late Enrique Álvarez Félix). This telenovela was made in 1969.', 'title': 'El retrato de Dorian Gray'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Ford Five Hundred is a full-size sedan that was produced by Ford Motor Company from the 2005 to 2007 model years. Deriving its name from the Ford Fairlane 500 and Ford Galaxie 500 popularized during the 1960s, the Five Hundred was introduced alongside the 2006 Ford Fusion as the replacements of the Ford Taurus. The larger of the two vehicles, the Five Hundred would also serve as an unofficial replacement for the Ford Crown Victoria in non-fleet markets. The Lincoln-Mercury Division marketed the Ford Five Hundred as the Mercury Montego, slotted below the Mercury Grand Marquis. As the Five Hundred was sold solely as a four-door sedan, the role of the Ford Taurus station wagon was taken over by the Ford Freestyle, repackaged as a crossover SUV.', 'title': 'Ford Five Hundred'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Dorian Gray (Italian: "Il dio chiamato Dorian") aka "The Sins of Dorian Gray" is a 1970 movie adaptation of Oscar Wilde\'s novel "The Picture of Dorian Gray" starring Helmut Berger. The Italian title translates as "A God Called Dorian".', 'title': 'Dorian Gray (1970 film)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Picture of Dorian Gray (German: Das Bildnis des Dorian Gray) is a 1917 German silent fantasy film directed by Richard Oswald and starring Bernd Aldor, Ernst Pittschau, and Ernst Ludwig. The film is based on the novel "The Picture of Dorian Gray" by Oscar Wilde.', 'title': 'The Picture of Dorian Gray (1917 film)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The Picture of Dorian Gray is a philosophical novel by Oscar Wilde, first published complete in the July 1890 issue of "Lippincott\'s Monthly Magazine". The magazine\'s editor feared the story was indecent, and without Wilde\'s knowledge, deleted roughly five hundred words before publication. Despite that censorship, "The Picture of Dorian Gray" offended the moral sensibilities of British book reviewers, some of whom said that Oscar Wilde merited prosecution for violating the laws guarding the public morality. In response, Wilde aggressively defended his novel and art in correspondence with the British press, although he personally made excisions of some of the most controversial material when revising and lengthening the story for book publication the following year.', 'title': 'The Picture of Dorian Gray'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Helen Shingler (born 19 August 1919) is a British film actress, widow of Seafield Laurence Stewart Murray Head, mother of actor/singer Murray Head, and actor Anthony Stewart Head and the grandmother of Kathryn and Sophie Head and actresses Emily and Daisy Head.', 'title': 'Helen Shingler'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"Come All You Fair and Tender Ladies" (a.k.a. "Tiny Sparrow" or "Little Sparrow") (Roud #451) is an American folk music ballad, originating from the Appalachian region. It has been recorded under either of its two title variations by numerous artists, including The Carter Family, Pete Seeger, Joan Baez, Odetta, Peter, Paul and Mary, The Kingston Trio, Leon Bibb, Makem and Clancy, Emmylou Harris, Bob Dylan, Dave Van Ronk, The Rankin Family, The Country Gentlemen, Murray Head and Dolly Parton. The title of the song varies from recording to recording and prior to the 1960s, the song was usually known as "Tiny Sparrow" or "Little Sparrow". Some versions substituted the "Sparrow" with "Swallow," another form of species of bird. (SOURCE: Pete Seeger version of the song). In more recent times, the song\'s title sometimes finds "Maidens" substituted for "Ladies," and "Come All Ye" or "Come All You" sometimes omitted.', 'title': 'Come All You Fair and Tender Ladies'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Murray Seafield St George Head (born 5 March 1946) is an English actor and singer, most recognised for his international hit songs "Superstar" (from the 1970 rock opera "Jesus Christ Superstar") and "One Night in Bangkok" (the 1984 single from the musical "Chess", which topped the charts in various countries), and for his 1975 album "Say It Ain\'t So". He has been involved in several projects since the 1960s and continues to record music, perform concerts, and make appearances on television either as himself or as a character actor.', 'title': 'Murray Head'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The 1970 World Sportscar Championship season was the 18th season of FIA World Sportscar Championship motor racing. It featured the 1970 International Championship for Makes and the 1970 International Cup for GT Cars, which were contested concurrently from 31 January to 11 October over a ten race series. The International Championship for Makes, which was open to Group 6 Sports-Prototypes, Group 5 Sports Cars and Group 4 Special GT Cars, was won by German manufacturer Porsche. The International Cup for GT Cars was also won by Porsche.', 'title': '1970 World Sportscar Championship'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Alan Henry Spenner (7 May 1948 – 11 August 1991) was an English bass player who performed with Wynder K. Frog, The Grease Band, Spooky Tooth, ABC, David Coverdale, David Soul, Joe Cocker, Lynda Carter, Peter Frampton, Ted Nugent, Mick Taylor, China Crisis, Murray Head, Kokomo, Roxy Music, and played on the original 1970 concept album "Jesus Christ Superstar".', 'title': 'Alan Spenner'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"Say It Ain\'t So, Joe" is a song written and performed by Murray Head. The song was released on Head\'s second studio album "Say It Ain\'t So", and was also released as a single in 1975.', 'title': "Say It Ain't So, Joe (song)"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Robert Joseph "Bob" Weston (1 November 1947 – 3 January 2012) was a British musician who had a brief role as guitarist and songwriter with the rock band Fleetwood Mac in the early 1970s. He also recorded and performed with a number of other musicians, including Graham Bond, Long John Baldry, Murray Head, Sandy Denny and Danny Kirwan.', 'title': 'Bob Weston (guitarist)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Irene Cara Escalera (born March 18, 1959) is an American singer, songwriter, and actress. She sang and co-wrote the international hit song \'Flashdance... What a Feeling\' (from the movie "Flashdance"), for which she won an Academy Award for Best Original Song and a Grammy Award for Best Female Pop Vocal Performance in 1984. She is also known for playing the role of Coco Hernandez in the 1980 film "Fame", and for recording the film\'s title song \'Fame\', which became an international hit. Cara also played the title character Sparkle Williams in the 1976 film "Sparkle".', 'title': 'Irene Cara'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Vinylshakerz (also known as Vanguard prior to 2005) were a German tech house/electro house act, formed in 2004 and best known for the 2005 remix of the Murray Head hit "One Night in Bangkok". The producers have also remixed material for other artists, mainly for dance compilation CDs.', 'title': 'Vinylshakerz'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': '"Superstar" is the title song from the 1970 rock opera "Jesus Christ Superstar" written by Andrew Lloyd Webber and Tim Rice.', 'title': 'Superstar (Jesus Christ Superstar song)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Luis Antonio Valencia Mosquera, commonly known as Antonio Valencia (] ; born 4 August 1985), is an Ecuadorian professional footballer who plays as a right winger and right-back for Manchester United and the Ecuador national team.', 'title': 'Antonio Valencia'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Hristo Atanasov Bonev-Zuma (Bulgarian: Христо Aтанасов Бонев ; born 3 February 1947 in Plovdiv, Bulgaria) is a former Bulgarian footballer, the second all-time leading scorer for the Bulgarian national team behind Dimitar Berbatov, who surpassed his record on 18 November 2009. He last managed PFC Lokomotiv Plovdiv in the Bulgarian A PFG. One of the greatest Bulgarian footballers, Bonev was renowned for his vision and technique.', 'title': 'Hristo Bonev'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Since the inception of the English football league competition, the Premier League, in 1992, more than 100 players have scored three goals (a hat-trick) or more in a single match. The first player to achieve the feat was Frenchman Eric Cantona, who scored three times for Leeds United in a 5–0 victory over Tottenham Hotspur. Twenty players have scored more than three goals in a match; of these, five players, Andy Cole, Alan Shearer, Jermain Defoe, Dimitar Berbatov and Sergio Agüero have scored five. Sadio Mané holds the record for the quickest Premier League hat-trick, netting three times for Southampton against Aston Villa in 2 minutes 56 seconds, breaking Robbie Fowler\'s record, while in 1999, Manchester United player Ole Gunnar Solskjær scored four goals in twelve minutes as a substitute against Nottingham Forest, "the fastest scorer of a four-goal haul on record in England".', 'title': 'List of Premier League hat-tricks'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Over 2,300 goals have been scored at the 20 editions of the FIFA World Cup final tournaments, excluding penalties converted during shoot-outs. Since the first goal scored by French player Lucien Laurent at the 1930 FIFA World Cup, over 1,200 footballers have scored goals at the World Cup, but only 90 of them have scored at least five goals.', 'title': 'FIFA World Cup top goalscorers'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Bayer 04 Leverkusen bounced back from the nearly disastrous season it came from, finishing in the top three and qualifying for the UEFA Champions League in the process. The season marked the breakthrough for Bulgarian striker Dimitar Berbatov, who scored 16 goals, whereas Brazilian signing França contributed with 14 strikes. As it was, it was the attack that impressed the most, especially in the 6–2 crushing of champions Werder Bremen on the penultimate day of the season.', 'title': '2003–04 Bayer 04 Leverkusen season'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "The 2010 FA Community Shield was the 88th FA Community Shield, an annual football match contested by the winners of the previous season's Premier League and FA Cup competitions. The match was played at Wembley Stadium, London, on 8 August 2010, and contested by league and cup double winners Chelsea and league runners-up Manchester United. Manchester United won the match 3–1 with goals from Antonio Valencia, Javier Hernández and Dimitar Berbatov; Chelsea's consolation goal came from Salomon Kalou. It was Manchester United's 14th outright victory in the Community Shield.", 'title': '2010 FA Community Shield'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Javier Hernández Balcázar ( \xa0\xa0 ; born 1 June 1988) is a Mexican professional footballer who plays as a striker for English club West Ham United and the Mexico national team. Hernández is commonly known by his nickname, Chicharito (Mexican Spanish: "little pea"), which he wears on his shirt.', 'title': 'Javier Hernández'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The 1967 FA Charity Shield was the 45th FA Charity Shield, an annual football match held between the winners of the previous season's Football League and FA Cup competitions. The match was contested by Manchester United, who had won the 1966–67 Football League, and Tottenham Hotspur, who had won the 1966–67 FA Cup, at Old Trafford, Manchester, on 12 August 1967. The match was drawn 3–3, which meant that the two clubs shared the Shield, holding it for six months each. Bobby Charlton scored two goals for United, while Denis Law scored their third. Jimmy Robertson and Frank Saul scored for Spurs, but the match is most famous for Tottenham's second goal, which was scored by goalkeeper Pat Jennings. Ball in hand, Jennings punted it downfield, only for it to bounce in front of United goalkeeper Alex Stepney, over his head and into the goal.", 'title': '1967 FA Charity Shield'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The 2011 Major League Soccer All-Star Game, held on July 27, 2011, was the 16th annual Major League Soccer All-Star Game, a soccer match involving all-stars from Major League Soccer. The MLS All-Stars faced Manchester United of the English Premier League for the second year running in the eighth MLS All-Star Game to feature international opposition. Manchester United won the game 4–0 with goals from Anderson, Park Ji-Sung, Dimitar Berbatov and Danny Welbeck.', 'title': '2011 MLS All-Star Game'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Ana-Maria Yanakieva (Bulgarian: Ана-Мария Янакиева , born 5 August 1998) is a Bulgarian singer from the music label Virginia Records, the official representative of Sony Music Entertainment for Bulgaria. She is also a scholar of Dimitar Berbatov Foundation. Ana-Maria is a finalist from Season 2 of X Factor Bulgaria, which took place in 2013. She is one of the most talented and promising Bulgarian young singers as considered by many music professionals in Bulgaria.', 'title': 'Ana-Maria Yanakieva'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'La Meyze is a railway station in La Meyze, Limousin, France. The station is located on the Nexon - Brive railway line. The station is served by TER (local) services operated by SNCF.', 'title': 'Gare de La Meyze'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Saint-Yrieix-la-Perche is a railway station in Saint-Yrieix-la-Perche, Limousin, France. The station is located on the Nexon - Brive railway line. The station is served by TER (local) services operated by SNCF.', 'title': 'Gare de Saint-Yrieix-la-Perche'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Nexon is a railway station in Nexon, Haute-Vienne, Limousin, France. The station is located on the Limoges-Bénédictins - Périgueux and Nexon - Brive railway lines. The station is served by TER (local) services operated by SNCF.', 'title': 'Gare de Nexon'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Coussac-Bonneval is a railway station in Coussac-Bonneval, Limousin, France. The station is located on the Nexon - Brive railway line. The station is served by TER (local) services operated by SNCF.', 'title': 'Gare de Coussac-Bonneval'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Lubersac is a railway station in Lubersac, Limousin, France. The station is located on the Nexon - Brive railway line. The station is served by TER (local) services operated by SNCF.', 'title': 'Gare de Lubersac'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Wizet (Korean: 위젯 ) was a game development studio located in Seoul, South Korea. They reached commercial success with their hit game MapleStory and were absorbed into their publishing company, Nexon America. Nexon developed a franchise system and expanded its services to Japan, China, Thailand, Malaysia, Singapore, Taiwan, the United States, Europe, Brazil, and Vietnam. Eventually, Wizet reached the global world after having finished developing key features of MapleStory.', 'title': 'Wizet'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Kru Interactive (now known as Nexon Inc.) is among the pioneers of online gaming and MMORPGs. Its headquarters is located in Santa Clara, California.', 'title': 'Kru Interactive'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Adam Gubman (April 7, 1979) is an American songwriter, arranger, and composer. Gubman\'s work varies from music from video games to pop and to television program\'s soundtrack, and it has been featured on dozens of television shows and commercials (including "America\'s Got Talent", "G4Tech TV", "MTV", "Real Housewives of Miami", "Aurora" and "Alguien Te Mira" by Univision , "Corazòn Valiente", multiple national "SKECHERS" campaigns). Gubman has composed music for more than 550 video games, many for prominent interactive software development companies (including "Ubisoft", "Nexon", "Sony Online Interactive", "Activision", "Square Enix", "Konami", "Electronic Arts", "GSN", "Storm8", "Gree","Playdom","PlayFirst", and Disney Online Interactive).', 'title': 'Adam Gubman'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Nexon (Hangul:\xa0넥슨 ; RR:\xa0"Nekseun " ) Co., Ltd. is a South Korean global leader in online games for PC and mobile. It services over 100 titles in over 190 countries. Nexon was founded in Seoul, South Korea in 1994 by Kim Jung Ju and Jake Song. In 2011, Nexon moved its headquarters from Seoul, South Korea to Tokyo, Japan.', 'title': 'Nexon'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'NDOORS Corporation is a Korean gaming corporation and developer of online games and MMORPGs and is a subsidiary of one of the world\'s largest online gaming companies, Nexon. Its headquarters are located in Seoul, South Korea. NDOORS Corporation first started out as "Intizen co., Ltd" in September 1999, but later changed their name in October 2004 to "Ndoors Corporation." On January 18, 2006, NDOORS Corporation took over Koong Entertainment which meant that NDOORS not only would be able to create PC Games, but PSP2 and PSP console games as well. The current CEO of NDOORS Corporation is Cho, SeongWon. The NDOORS logo can be simplified as "Distinction, Sympathy, and Expansion."', 'title': 'NDOORS Corporation'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The South Pacific air ferry route was initially established in the 1920s to ferry United States Army Air Service aircraft to the Philippines. As the Japanese threat in the Far East increased in 1940, General Douglas MacArthur planned that in the event of war, the United States Army Air Corps would play a major role in defending the Philippines. The reinforcement by the Air Corps of forces in the Philippines, and later Allied forces in Australia, became the basis for developing the South Pacific air ferry route used during World War II.', 'title': 'South Pacific air ferry route in World War II'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Taishō Katsuei (大正活映 ) was a Japanese film studio active in the early 1920s. Founded in April 1920 by Ryōzō Asano, the son of zaibatsu head Sōichirō Asano, it was mostly known as Taikatsu for short. Its origins can be traced back to Tōyō Film (also known as the "Sunrise Film Manufacturing Company"), a venture started in 1918 by Benjamin Brodsky and Thomas Kurihara, that Asano ended up supporting. With Kurihara as the main director and Jun\'ichirō Tanizaki as the literary consultant, Taikatsu was one of two studios founded in 1920 (the other being Shōchiku Kinema) that publicly announced their intention to make "pure films" in line with the Pure Film Movement. It established an actors school and began production with "Amateur Club", a film directed by Kurihara and scripted by Tanizaki that was strongly influenced by American cinema. Other important works include "A Serpent\'s Lust", another Kurihara-Tanizaki collaboration based on the same story as "Ugetsu" by Kenji Mizoguchi. The Taikatsu studio was located in Yokohama, below the Bluff and the Foreigner\'s Cemetery (a memorial tablet currently marks the site). Taikatsu did not last long, since it did not have enough theaters to recoup the costs of production and of importing American films. Its production division was taken over by Shōchiku in 1922, even though the company lasted a few more years as an exhibition business. A number of important film figures emerged from Taikatsu, including the directors Tomu Uchida and Buntarō Futagawa and the actors Tokihiko Okada, Ureo Egawa and Atsushi Watanabe.', 'title': 'Taishō Katsuei'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'This page has most if not all of Betty Compson\'s known film appearances 1915–48. Films from 1915 to 1919 are shorts, mostly for Al Christie unless otherwise stated. A big breakout came in 1919 with "The Miracle Man" now lost. In the early-to-mid 1920s Compson was a major player at Paramount with her name above the title of her films. By the end of the decade she was free-lancing and appearing as feature and support with name below the title of the film. Her star definitely took a fall somewhere after marrying director James Cruze, and she would remain a feature support into the sound era for the rest of her film career.', 'title': 'Betty Compson filmography'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The 1920 NCAA baseball season, play of college baseball in the United States organized by the National Collegiate Athletic Association (NCAA) began in the spring of 1920. Play largely consisted of regional matchups, some organized by conferences, and ended in June. No national championship event was held until 1947.', 'title': '1920 NCAA baseball season'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'NZWPW Tag Team Championship is the top professional wrestling tag team championship title in the New Zealand promotion New Zealand Wide Pro Wrestling. The title was first won by The Superlatives (Jean Miracle and Nick Silver), who won a tournament final at Power Play IV in Lower Hutt, New Zealand to win the titles on 14 April 2007. It was the first title of its kind to be established by a major promotion since the NWA Australasian Tag Team Championship during the early 1980s and remains the oldest currently active tag team championship in New Zealand.', 'title': 'WPW Tag Team Championship'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Women\'s PGA Championship is an annual golf competition held in June, and is conducted by the Professional Golfers Association of America (PGA). The event was established in 1955, and is one of the five women\'s major championships played each year; the others are the ANA Inspiration, the U.S. Women\'s Open, the Women\'s British Open, and the Evian Championship. This event has always been conducted in stroke play competition, and is always the second women\'s major of the year. The first year was played with three rounds of stroke play and a final round of match play to determine the final places (36 holes for the championship, 18 holes for other matches) in order to distribute prize money. The trophy, formally known as the "LPGA Championship Trophy" is presented to the champion every year, with each recipient being awarded a replica of the trophy to keep.', 'title': "List of Women's PGA Championship champions"}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Max Reinhardt (September 9, 1873 – October 30, 1943) was an Austrian-born American theatre and film director, intendant, and theatrical producer. With his innovative stage productions, he is regarded as one of the most prominent directors of German-language theatre in the early 20th century. In 1920, he established the Salzburg Festival with the performance of Hofmannsthal\'s "Jedermann".', 'title': 'Max Reinhardt'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Prince Matchabelli is a perfume line. It was first designed by Prince Georges V. Matchabelli who was an amateur chemist. Georges Matchabelli was a Georgian prince and Georgian ambassador to Italy, but fled the Soviet Union and emigrated to the United States after the Russian Revolution. In New York City he and his wife, Princess Norina Matchabelli (an actress whose stage name was Maria Carmi), opened a small antiques shop, "Le Rouge et le Noir", at 545 Madison Avenue. The name came from Stendhal\'s novel of that name, which they interpreted as the red for the aristocracy for him and black for the religious (The Miracle, a famous religious play in which Norina had starred). (Stendhal\'s interpretation of the names was somewhat different: the only two choices open to his hero, Julien Sorel, a poor man for career glory and advancement—red for military and black for clergy.) They later established the Prince Matchabelli Perfume Company in 1926. Perfumes were personally blended for clients by Prince Matchabelli. The first three perfumes were Princess Norina, Queen of Georgia and Ave Maria. The company became known for the many color-coded, crown-shaped bottles designed by Norina after the Matchabelli crown and introduced in 1928 with labels on the underside.', 'title': 'Prince Matchabelli'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The Miracle is a 1959 film directed by Irving Rapper and starring Carroll Baker and Roger Moore. It is a remake of the 1912 hand-colored, black-and-white film "The Miracle", which was in turn a production of the 1911 pantomime play "The Miracle" written by Karl Vollmöller and directed by Max Reinhardt.', 'title': 'The Miracle (1959 film)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Afterlife is a 2008 play by Michael Frayn. It tells the life and career of Austrian theatrical director and actor Max Reinhardt, from the revival of the Salzburg Festival in 1920, which he helped to re-establish, until his death in New York in 1943. It draws from Hugo von Hofmannsthal's 1911 play Jedermann (based on the sixteenth-century English morality play, Everyman), which Reinhardt directed at the Salzburg Festival for many years following its revival in 1920.", 'title': 'Afterlife (play)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Green Man is an independent music and arts festival held annually in mid-August in the Brecon Beacons, Wales since 2003. It has evolved into a 20,000 capacity 4-day event, showcasing predominantly live music (in particular alternative, indie, rock, folk, dance and americana), with additional events showcasing literature, film, comedy, theatre and poetry. 2015 saw 1,500 multi-arts acts perform across 17 stages. The festival site is divided into 10 areas, each offering a unique festival experience. Ceilidhs, all-night bonfires and secret gigs all add to the festival's unique identity.", 'title': 'Green Man Festival'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The All Points West Music & Arts Festival was an annual music and arts festival held at Liberty State Park in Jersey City, New Jersey. First held in August 2008, it is hosted by Goldenvoice/AEG Live events, the same company that hosts the similar annual Coachella Valley Music and Arts Festival every year in Indio, California. The event lasts all day, from noon to about midnight, for eleven and a half hours per day. All Points West 2009 was held on July 31, August 1 and 2 featuring both music, comedy and art, much like its counterpart in Indio.', 'title': 'All Points West Music &amp; Arts Festival'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The White Nights are a kind of all-night arts festival held in many cities in the summer. The original festival is the White Nights Festival held in Saint Petersburg, Russia. The "white nights" is the name given in areas of high latitude to the weeks around the summer solstice in June during which sunsets are late, sunrises are early and darkness is never complete. In Saint Petersburg, the Sun does not set until after 10 p.m., and the twilight lasts almost all night.', 'title': 'White Night festivals'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Tanglewood Music and Arts Festival is an annual two-day music, comedy and arts event held within the grounds of Narrow Water Castle, County Down, Northern Ireland. The festival, founded in 2011, has attracted significant attention both within the local area and around Northern Ireland with buses coming from as far as Belfast to the event. For the 2011 and 2012 festivals Tanglewood was held on one day; however for 2013 it has expanded into a two-day camping festival.', 'title': 'Tanglewood Music and Arts Festival'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Artscape is an annual art festival held in the Mount Royal neighborhood of Baltimore, Maryland in July. Since its first annual event in 1982, it has become the largest free arts festival in America. It has boasted acts such as Ray Charles, Aretha Franklin, and Matisyahu in the past, attracting over 350,000 people from the city, and surrounding areas. Film programming during Artscape is provided by Maryland Film Festival. There are artists in a variety of visual and performing media. Events are free and open to the public.', 'title': 'Artscape (festival)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The Great Northern Arts Festival is held each year in Inuvik, Northwest Territories. Lasting approximately ten days, it is an annual event held each summer. It was established in 1989 by Sharlene Alexander and Sue Rose. While the festival's mandate is to serve Northern artists and craftspeople, artists from around the world also attend. The festival is designed as a venue for artists to see each other's work and to experiment with new applications. It includes arts of all types, such as fiber art and Music of the Northwest Territories. Artists partake in demonstrations, masterclasses, seminars, and workshops. The festival's gallery offers pieces for sale. There are cultural presentations each evening which include concerts, dance, fashion, music, and storytelling. Media coverage brings festival highlights to viewing audiences.", 'title': 'Great Northern Arts Festival'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Dogwood Arts Festival is an annual event in Knoxville, Tennessee, sponsored by Dogwood Arts, a 501(c)3 nonprofit organization whose mission is to promote and celebrate regional art, culture, and natural beauty. The event is held in April and celebrates the blooming of the dogwood trees. It includes a parade, a house and garden show, and demonstrations of various Appalachian arts and crafts such as quilting, bluegrass music, and doll-making. Many events are held in Market Square in downtown Knoxville. Additionally, driving trails are marked in Knoxville and the surrounding area for people to view the dogwoods in bloom.', 'title': 'Dogwood Arts Festival'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Night of the Arts (Finnish: "Taiteiden yö" , Swedish: "Konstens natt" ) is an annual event held in several major cities in Finland, in late August. It is one of many White Night festivals held worldwide.', 'title': 'Night of the Arts'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Lubbock Arts Festival is an annual arts festival held in April at the Lubbock Memorial Civic Center in Lubbock, Texas. The festival is the largest fine arts and crafts show in West Texas. Since its establishment in 1978, the Lubbock Arts Festival focuses on visual, performing, culinary, and children’s art. The 2013 Lubbock Arts Festival drew a record attendance of over 30,000. In 2014, the Silent Wings Museum participated in the festival.', 'title': 'Lubbock Arts Festival'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'School Arts Festival of Kerala (Malayalam: കേരള സ്കൂൾ കലോത്സവം) is an annual event conducted by the state government of Kerala, featuring several art competitions for high school and higher secondary school students of Kerala. The festival was started in 1956, and till 2008, it was called as "Kerala State School Youth Festival". The participants are students from classes 8th to 12th. Winners from different revenue districts for a particular event will be competing in state level competition. The event is usually conducted in December–January months of a year and is considered to be the biggest cultural event of Asia. 57th edition of Kerala School Kalolsavam 2017 is scheduled for January 16 to 22 at Kannur.', 'title': 'Kerala School Kalolsavam'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Into the Mirror () is a 2003 South Korean horror film about a series of grisly deaths in a department store, all involving mirrors, and the troubled detective who investigates them. It was the debut film of director Kim Sung-ho.', 'title': 'Into the Mirror'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Chun Woo-hee (born April 20, 1987) is a South Korean actress. She made her acting debut in 2004, but first drew attention with her supporting role as a rebellious teenager in the 2011 box-office hit "Sunny". In 2014, Chun received domestic and international critical acclaim for her first leading role as the title character in "Han Gong-ju", a coming-of-age indie about a traumatized young woman trying to move on with her life after a tragedy. Her other notable films include "The Beauty Inside" (2015), "Love, Lies" (2016) and "The Wailing" (2016).', 'title': 'Chun Woo-hee'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Argon () is a 2017 South Korean television series starring Kim Joo-hyuk and Chun Woo-hee about passionate reporters. The series marks Chun Woo-hee's first small screen lead role. It aired on cable channel tvN every Monday and Tuesday at 22:50 (KST) from September 4 to September 26, 2017.", 'title': 'Argon (TV series)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Han Gong-ju () is a 2013 South Korean film written and directed by Lee Su-jin, starring Chun Woo-hee in the title role. It was inspired by the infamous Miryang gang rape case of 2004.', 'title': 'Han Gong-ju'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'One Day () is a 2017 South Korean drama film directed by Lee Yoon-ki and starring Kim Nam-gil and Chun Woo-hee. The film was released on April 5, 2017.', 'title': 'One Day (2017 film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Whispering Corridors (; also known as Ghost School and Ghost School Horror) is a South Korean horror film series. The series uses an all-girls high school as the backdrop for each of its films and doesn\'t share a continuing plot. Every "Whispering Corridors" film features a different plot, characters and settings. The series is notable for helping generate the explosion of the New Korean Wave cinematic movement, and dealing with taboo topics such as authoritarianism in the harsh South Korean education system, gay relationships and teen suicide, following the liberalization of censorship.', 'title': 'Whispering Corridors (film series)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Thirst (Korean: 박쥐; Bakjwi ; literally: "Bat") is a 2009 South Korean horror film written, produced and directed by Park Chan-wook. It is loosely based on the novel "Thérèse Raquin" by Émile Zola. The film tells the story of a Catholic priest—who is in love with his friend’s wife—turning into a vampire through a failed medical experiment. Park has stated, "This film was originally called \'The Bat\' to convey a sense of horror. After all, it is about vampires. But it is also more than that. It is about passion and a love triangle. I feel that it is unique because it is not just a thriller, and not merely a horror film, but an illicit love story as well." The film won the Jury Prize at the 2009 Cannes Film Festival. It is the first mainstream Korean film to feature full-frontal male nudity.', 'title': 'Thirst (2009 film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Love, Lies () is 2016 South Korean period drama film directed by Park Heung-sik, reuniting "The Beauty Inside" co-stars Han Hyo-joo, Chun Woo-hee and Yoo Yeon-seok. The story takes place in 1943, during the Imperial Japanese occupation of Korea. In the film, best friends Jung So-yul (Han Hyo-joo) and Seo Yeon-hee (Chun Woo-hee) are two of the last remaining "gisaeng". Although they enjoy pop music, they are committed to singing "jeongga", or classical Korean songs. So-yul\'s life falls apart when her lover, pop music producer Kim Yoon-woo (Yoo Yeon-seok), falls in love with Yeon-hee and helps her debut as a pop singer. The story follows So-yul\'s downward spiral as she is consumed by uncontrollable jealousy.', 'title': 'Love, Lies (2016 film)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The Wailing () is a 2016 South Korean horror film directed by Na Hong-jin about a policeman who investigates a series of mysterious killings and illnesses. It was a commercial success.', 'title': 'The Wailing (film)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Dead Friend (; lit. "The Ghost") is a 2004 South Korean horror film. It is one of a number of South Korean horror films set in high school; the trend began with 1998\'s "Whispering Corridors".', 'title': 'Dead Friend'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Steve Albert (born Stephen Aufrichtig in Brooklyn, New York) was an American sportscaster. He has served as a play-by-play announcer for the New Jersey Nets, New Orleans Hornets, Golden State Warriors, New York Mets, and Phoenix Suns. He last was the television play-by-play announcer for the Phoenix Suns. He retired after the Phoenix Suns 2016-2017 season.', 'title': 'Steve Albert'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Eli Gold (born December 15, 1953) is an American sportscaster. Gold is best known as the radio voice for the Alabama Crimson Tide football team, along with Tom Roberts, as part of the Crimson Tide Sports Network since 1988. He has also been the host of "NASCAR Live" on the Motor Racing Network since 1982. He formerly called play-by-play for Arena Football League\'s coverage on TNN and NBC and currently calls college football and NFL games for Sports USA Radio Network.', 'title': 'Eli Gold'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Spencer Ross is an American sportscaster. With the exception of the New York Mets, Ross has called play-by-play for every professional New York metropolitan area sports franchise, including the Yankees of MLB, the Nets and Knicks of the NBA, and Jets and Giants of the NFL. He has also called games for the Americans of the ABA and, in the NHL, for the New Jersey Devils, New York Islanders and the New York Rangers. Outside of New York, he has called games for the Florida State Seminoles and Boston Celtics. Nationally, he has worked for the "NFL on NBC", "Major League Baseball on CBS Radio", the NCAA Basketball Tournament on Westwood One Radio and as the lead play by play announcer for the 1992 USA Olympic Dream Team with Dick Vitale.', 'title': 'Spencer Ross'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'John Murphy is an American sportscaster from Buffalo, New York. He is best known as the voice of the Buffalo Bills Radio Network and host of "The John Murphy Show" on WGR and MSG Western New York. In addition to the Bills, he also served as commentator for the Buffalo Bisons, Canisius College Golden Griffins, Buffalo Bulls and Niagara University Purple Eagles in the 1980s.', 'title': 'John Murphy (sportscaster)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Victor/Victoria is a 1995 videotaped television production of the Broadway musical of the same name written and directed by Blake Edwards, starring Julie Andrews, Tony Roberts, Michael Nouri, Rachel York, Richard B. Shull and Gregory Jbara. The play's opening night performance on October 25, 1995 at the Marquis Theatre in New York City was filmed exclusively for Japanese television broadcast by NHK on December 23, 1995. It was directed for the stage by Edwards and directed for television by Matthew Diamond and Goro Kobayashi.", 'title': 'Victor/Victoria (1995 film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Randall James Karraker (born August 19, 1962) is an American sportscaster in St. Louis, Missouri. He hosts "The Fast Lane", the top-rated sports radio show in St. Louis, on 101 ESPN, with former St. Louis Cardinals player Brad Thompson and Chris Rongey. He was also the host of the St. Louis Rams pregame shows on 101 ESPN up until the team\'s move to Los Angeles in January 2016. He hosted this show with former NFL coach Jim Hanifan, before Hanifan was replaced by Rick Venturi in 2009, and then with Anthony Stalter up until the team\'s departure. In 2009 and 2010, he was also the television voice of Southern Illinois Edwardsville Cougars basketball on CCIN. He used to be the host of the popular CCIN television program "Chalk Talk", with Malcolm Briggs, McGraw Millhaven, and Tony Twist.', 'title': 'Randy Karraker'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Al Meltzer (born 1928), nicknamed "Big Al", is a retired American sportscaster. Meltzer worked for Channel 10 and Channel 3 in Philadelphia, and Comcast SportsNet (as sports director). He also worked for WPHL-17 where he called play-by-play of Big 5 and 76ers basketball. He has also covered the Philadelphia Eagles, Philadelphia Phillies, and Temple Owls. Previously, he worked in Buffalo, New York at WEBR. He is a member of the Jewish Sports Hall of Fame, Big 5 Hall of Fame, the Philadelphia Sports Hall of Fame and Broadcast Pioneers of Philadelphia Hall of Fame. During the 1970s, Meltzer, while still living in Philadelphia, commuted to Buffalo to serve as the Buffalo Bills Radio Network play-by-play announcer, serving on a team with Rick Azar and Ed Rutkowski.', 'title': 'Al Meltzer'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The 1987 Annual World's Best SF is an anthology of science fiction short stories edited by Donald A. Wollheim and Arthur W. Saha, the fourteenth volume in a series of nineteen. It was first published in paperback by DAW Books in June 1987, followed by a hardcover edition issued in July of the same year by the same publisher as a selection of the Science Fiction Book Club. For the hardcover edition the original cover art by Tony Roberts was replaced by a new cover painting by Richard Powers.", 'title': "The 1987 Annual World's Best SF"}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Tony Roberts (born 1928) is an American retired sportscaster who was the play-by-play announcer for the Notre Dame Fighting Irish football team from 1980 until 2006. He is a member of the Indiana Broadcasters Hall of Fame, Holiday Bowl Hall of Fame and College Football Hall of Fame. In 2005, he won the Chris Schenkel Award. In 2006, he was replaced by Don Criqui as play-by-play announcer for Notre Dame.', 'title': 'Tony Roberts (sportscaster)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Don Criqui (born May 5, 1940, Buffalo, New York) is an American sportscaster, currently the radio voice of Notre Dame Fighting Irish football.', 'title': 'Don Criqui'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Za\'atar (Arabic: زَعْتَر\u200e \u200e , ] ) is a generic name for a family of related Middle Eastern herbs from the genera "Origanum" (oregano), "Calamintha" (basil thyme), "Thymus" (typically "Thymus vulgaris", i.e., thyme), and "Satureja" (savory). The name "za\'atar" alone most properly applies to "Origanum syriacum", considered in biblical scholarship to be the hyssop (Hebrew: אזוב\u200e \u200e ] ) of the Hebrew Bible. It is also the name for a condiment made from the dried herb(s), mixed with sesame seeds, dried sumac, and often salt, as well as other spices. Used in Levantine cuisine, both the herb and spice mixture are popular throughout the Middle East.', 'title': "Za'atar"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Origanum libanoticum (Lebanese oregano, hopflower oregano, cascading hopflower oregano, ornamental oregano or cascading oregano) is a species of herbaceous flowering plant in the family Lamiaceae, native to the mountains of Lebanon and Syria.', 'title': 'Origanum libanoticum'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Oregano ( or ; ;, scientific name "Origanum vulgare", is a flowering plant in the mint family (Lamiaceae). It is native to temperate western and southwestern Eurasia and the Mediterranean region.', 'title': 'Oregano'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Catasetum, abbreviated as Ctsm in horticultural trade, is a genus of showy epiphytic Orchids, family Orchidaceae, subfamily Epidendroideae, tribe Cymbidieae, subtribe Catasetinae, with 166 species, many of which are highly prized in horticulture.', 'title': 'Catasetum'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Origanum syriacum; syn. Majorana syriaca (also Origanum maru, although this primarily refers to a hybrid of "O. syriacum"), bible hyssop, Biblical-hyssop, Lebanese oregano or Syrian oregano, is an aromatic perennial herb in the mint family, Lamiaceae.', 'title': 'Origanum syriacum'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Origanum rotundifolium, the round-leaved oregano, is a species of flowering plant in the family Lamiaceae, native to Turkey, Armenia and Georgia. It is a small woody-based perennial or subshrub growing to 10 - tall by 30 cm wide, with strongly aromatic leaves, and loose clusters of pink flowers with hop-like pale green bracts, throughout the summer.', 'title': 'Origanum rotundifolium'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Origanum laevigatum is a species of flowering plant in the family Lamiaceae, native to Cyprus, Syria, and Turkey. It is a woody-based perennial growing to 50 - tall by 45 cm wide, with strongly aromatic leaves, and loose clusters of pink funnel-shaped flowers with persistent purple bracts, throughout the summer.', 'title': 'Origanum laevigatum'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Origanum amanum, the Amanum oregano, is a species of flowering plant in the family Lamiaceae, native to the Hatay Province of southern Turkey, bordering on Syria. It is an evergreen subshrub growing to 10 - tall by 30 cm wide, with strongly aromatic leaves, and clusters of pink funnel-shaped flowers in summer and autumn.', 'title': 'Origanum amanum'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Origanum ( )is a genus of herbaceous perennials and subshrubs in the family Lamiaceae, native to Europe, North Africa, and much of temperate Asia, where they are found in open or mountainous habitats. A few species also naturalized in scattered locations in North America and other regions.', 'title': 'Origanum'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Cooperative Living Organization (formerly Collegiate Living Organization) or CLO in Gainesville, Florida, is one of the oldest continuously operating independent student-governed cooperative living organizations in the United States. The 80-year-old organization has provided over 2000 financially disadvantaged students an opportunity for a University of Florida education while providing experience in independent and socially responsible living by pooled resources and self-governance.', 'title': 'Cooperative Living Organization'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Mason is a city in the U.S. state of Michigan. It is named after the state's first governor, Stevens T. Mason. As of the 2010 census, the city population was 8,252. It is the county seat of Ingham County. Mason is the only city in the U.S. that serves as a county seat ahead of a state capital, with the capital of Lansing also in Ingham County. Despite Mason being the county seat, many county offices and courtrooms are located in Lansing.", 'title': 'Mason, Michigan'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Cumberland Homesteads is a community located in Cumberland County, Tennessee, United States. Established by the New Deal-era Division of Subsistence Homesteads in 1934, the community was envisioned by federal planners as a model of cooperative living for the region\'s distressed farmers, coal miners, and factory workers. While the cooperative experiment failed and the federal government withdrew from the project in the 1940s, the Homesteads community nevertheless survived. In 1988, several hundred of the community\'s original houses and other buildings, which are characterized by the native "crab orchard" sandstone used in their construction, were added to the National Register of Historic Places as a historic district.', 'title': 'Cumberland Homesteads'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Florida's 16th congressional district is an electoral district for the U.S. Congress and was reassigned in 2012, effective January 2013, to western Manatee County, Florida and Sarasota County. The district stretches from Bradenton, the County Seat, in Manatee County to North Port, in Sarasota County, the county's youngest and most populous incorporated city. The city of Sarasota is the County Seat of Sarasota County.", 'title': "Florida's 16th congressional district"}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Gainesville is the county seat and largest city in Alachua County, Florida, United States, and the principal city of the Gainesville, Florida Metropolitan Statistical Area (MSA). The population of Gainesville in the 2013 US Census estimates was 127,488, a 2.4% growth from 2010. Gainesville is the largest city in the region of North Central Florida. It is also a component of the Gainesville-Lake City Combined Statistical Area, which had a 2013 population of 337,925.', 'title': 'Gainesville, Florida'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Ellicott City is an unincorporated community and census-designated place, along with being the county seat of local government in Howard County, Maryland, United States. It is part of the Baltimore Metropolitan Area. The population was 65,834 at the 2010 census. Founded in 1772, the town contains the B. & O. Railroad Museum's branch at the Ellicott City Station, built in 1830 as the first terminus of the initial line. The downtown historic district is located in the valley of the small Tiber River, with its east end abutting the Patapsco River, which forms the Baltimore County line. As of the 2000 census, Ellicott City surpassed Towson (county seat of neighboring Baltimore County) for the first time, as the largest unincorporated county seat in the country.", 'title': 'Ellicott City, Maryland'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "There are 67 counties in the state of Florida. It became a territory of the U.S. in 1821 with two counties complementing the provincial divisions retained as a Spanish territory: Escambia to the west and St. Johns to the east, divided by the Suwannee River. All of the other counties were apportioned from these two original counties. Florida became the 27th U.S. state in 1845, and its last county was created in 1925 with the formation of Gilchrist County from a segment of Alachua County. Florida's counties are subdivisions of the state government. In 1968, counties gained the power to develop their own charters. All but two of Florida's county seats are incorporated municipalities. The exceptions are Crawfordville, county seat of rural Wakulla County, and East Naples, located outside Naples city limits in Collier County.", 'title': 'List of counties in Florida'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Johnston Library is a historic library located at 210 W. 10th St. in Baxter Springs, Kansas. The building was constructed in 1872 to serve as a courthouse during Baxter Springs' unsuccessful attempt to become the Cherokee County seat. Though Baxter Springs had lost an election to choose the county seat in 1869 to Columbus, supporters of both cities had attempted to fraudulently swing the election in their favor, and Baxter Springs hoped it could still become county seat in the future. The building initially served as the county jail and sheriff's office until Columbus completed its jail in 1880. After this, Baxter Springs ultimately gave up its attempts to become the county seat, and the building became its city hall. In 1905, resident Niles P. Johnston bequeathed $5,000 to the city to start a library, and the city hall building was chosen to house it.", 'title': 'Johnston Library'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Cerro Gordo County Courthouse is located in Mason City, Iowa, United States. When Cerro Gordo County was created in 1855 and Mason City was selected to be the county seat. Dissatisfaction in the western part of the county led the Iowa legislature to appoint three new commissioners who would move the county seat to Livonia. A courthouse was built there. A petition signed by over half of the citizens of the county requested that the county seat be moved back to Mason City. Mason City also won the election in 1858 to decide the matter 155-48. Two courthouses have stood in Mason City prior to the present Modernist structure that was occupied by the county in 1960. It had been built as the Standard Oil Building, and was acquired by the county in 1959 for $159,400 and then remodeled for their use.', 'title': 'Cerro Gordo County Courthouse (Iowa)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The Tampa–Hillsborough County Public Library System (THPL) is a public library system based in Hillsborough County, Florida. The State Library of Florida is the main library source for Government of Florida as well as governs a large portion of Florida's public and private libraries. THPL is part of two larger library networks, the Hillsborough County Public Library Cooperative and the Tampa Bay Library Consortium, which also includes Temple Terrace Public Library in Temple Terrace, Florida, and Bruton Memorial Library in Plant City, Florida. There are 25 branches of the Tampa–Hillsborough County Library System, not including digital-only and mobile-only services. Services provided by the THPL include (but are in no way limited to) internet access, public meeting room spaces, interlibrary loans, a Bookmobile, a Cybermobile for Spanish speakers, technology classes, adult literacy programs, and downloadable eBooks. Drive-thru windows for returns and hold pick-ups are located at the Jimmie B. Keel and the Jan Kaminis Platt Regional Libraries. The Tampa–Hillsborough County Public Library System is also a part of Hillsborough County government.", 'title': 'Tampa–Hillsborough County Public Library System'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Jack is a 2015 Austrian thriller film about serial killer Jack Unterweger, directed by Elisabeth Scharang. It was screened in the Contemporary World Cinema section of the 2015 Toronto International Film Festival.', 'title': 'Jack (2015 film)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Play The Game! is a 2015 Austrian mystery thriller film portraying a series of events which take place in the context of a real-life game. It was written and directed by Jörg Helbig. The film uses elements of film noir and psychological thriller. It opened in Austria on June 16, 2015.', 'title': 'Play the Game (2015 film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Charles Edmund Cullen (born February 22, 1960) is a former nurse who is the most prolific serial killer in New Jersey history and is suspected to be the most prolific serial killer in American history. He confessed to authorities that he killed up to 40 patients during the course of his 16-year nursing career. But in subsequent interviews with police, psychiatric professionals, and journalists Charles Graeber and Steve Kroft, it became clear that he had killed many more, whom he could not specifically remember by name, though he could often remember details of their case. Experts have estimated that Charles Cullen may ultimately be responsible for 400 deaths, which would make him the most prolific serial killer in American history.', 'title': 'Charles Cullen'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Raman Raghav 2.0 is a 2016 Indian neo noir psychological thriller film directed by Anurag Kashyap. Nawazuddin Siddiqui plays the role of Ramanna, a psychopathic serial killer inspired by a serial killer who operated in Mumbai during the mid-1960s named Raman Raghav. Vicky Kaushal plays Raghavan, a cop assigned to investigate the serial killings. The film premiered at the Cannes Directors’ Fortnight to a positive critical reception, raising hopes of a good showing at the box office. It was released on 24 June 2016.', 'title': 'Raman Raghav 2.0'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Revanche is a 2008 Austrian thriller film written and directed by Götz Spielmann. It centers on the ill-fated love story between a Viennese ex-con and a Ukrainian prostitute who get involved in a bank robbery.', 'title': 'Revanche (film)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Johann "Jack" Unterweger (16 August 195029 June 1994) was an Austrian serial killer who murdered prostitutes in several countries. First convicted of a 1974 murder, he was released in 1990 as an example of rehabilitation. He became a journalist and minor celebrity, but within months started killing again. He committed suicide following a conviction for several murders. Austrian psychiatrist Dr. Reinhard Haller diagnosed him with narcissistic personality disorder in 1994.', 'title': 'Jack Unterweger'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Hannah is a 1997 Austrian thriller film directed by Reinhard Schwabenitzky. The film was selected as the Austrian entry for the Best Foreign Language Film at the 69th Academy Awards, but was not accepted as a nominee.', 'title': 'Hannah (1997 film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Sun Hill Serial Killer was a major storyline from ITV\'s cop show "The Bill". Known originally as the "River Murders", the storyline spanned several months in 2002 and served as the exit for popular cast regular Cass Rickman (played by Suzanne Maddock). It was the first of several serial killer storylines from the show. Events came to a head in the New Year of 2003, when Acting DI Samantha Nixon discovers the truth and is taken hostage by the serial killer, before a final confrontation in which she is overpowered by DC Duncan Lennox, charged and thrown into the cells at Sun Hill Station.', 'title': 'Sun Hill Serial Killer'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The House That Jack Built is an upcoming psychological horror thriller film written and directed by Lars von Trier, starring Matt Dillon in the title role of Jack. The story follows Jack, a serial killer, over the course of 12 years in the 1970s and 1980s in the US state of Washington. Von Trier has described the film as celebrating "the idea that life is evil and soulless."', 'title': 'The House That Jack Built (2018 film)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Ek Villain (English: "One Villain") is a 2014 Indian romantic thriller directed by Mohit Suri. The film stars Sidharth Malhotra, Shraddha Kapoor and Riteish Deshmukh in lead roles, and tells the story of a hardened criminal whose terminally ill wife is murdered by a serial killer. The film was produced by Ekta Kapoor and Shobha Kapoor under Balaji Motion Pictures and ALT Entertainment. The film is an unofficial remake of the 2010 South Korean action thriller film "I Saw the Devil". Upon its release on 27 June 2014, the film received mixed to positive reviews from the critics, and was a commercial success.', 'title': 'Ek Villain'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Bleed" is the third single by metal band Soulfly, released in 1998 from the self-titled album "Soulfly". Limp Bizkit guest members Fred Durst and DJ Lethal sing this song about pain, lying and madness with lyrics written by Durst and Max Cavalera. This song tributes Cavalera for the untimely death of his stepson Dana.', 'title': 'Bleed (Soulfly song)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Roots is the sixth studio album by Brazilian heavy metal band Sepultura. It was released in Europe on \xa020,\xa01996\xa0(1996--) and in the U.S. three weeks later on March 12 by Roadrunner Records. It is the band\'s last studio album to feature founding member and vocalist/rhythm guitarist Max Cavalera. Following the shift to slower tempos and Latin-tinged rhythms on the album "Chaos A.D.", "Roots" delves even further into Brazilian musical textures and features significant contributions from Brazilian musician Carlinhos Brown, who guided and arranged the sections throughout the album that feature ensemble percussion playing. The song "Lookaway" also features guest appearances by Korn vocalist Jonathan Davis, former Korn drummer David Silveria, former Limp Bizkit turntablist DJ Lethal, and Faith No More/Mr. Bungle/Tomahawk/Fantômas vocalist Mike Patton. The album draws influence from the then-surging nu metal movement, specifically Korn (whose first two albums were also produced by Ross Robinson) and Deftones. (After leaving the band, Max Cavalera would continue to pursue the nu metal and "world" stylings of "Roots" with his solo project Soulfly.) Since its release, "Roots" has sold over 2 million copies worldwide.', 'title': 'Roots (Sepultura album)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Point Blank is the only studio album by heavy metal band Nailbomb, released on March 8, 1994 by Roadrunner Records. The side project "Nailbomb" was started by Max Cavalera and Alex Newport in the mid-1990s. The first track "Wasting Away" appears in the 1995 film "To Die For". The album cover is a female Vietcong member with a U.S. soldier\'s gun to her head. The album is set to be played live in its entirety for the first time ever, later in 2017 by Max Cavalera performing under his band Soulfly, more than 20 years after the release of the album and the band\'s break up. However, Alex Newport will not be part of these performances.', 'title': 'Point Blank (Nailbomb album)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'William Michael Albert Broad (born 30 November 1955), known professionally as Billy Idol, is an English musician, singer, songwriter, and actor. He first achieved fame in the 1970s as a member of the punk rock band Generation X. Subsequently, he embarked on a solo career which led to international recognition and made Idol one of the lead artists during the MTV-driven "Second British Invasion" in the United States.', 'title': 'Billy Idol'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The following is the discography of Soulfly, a heavy metal band formed in 1997 by Max Cavalera after leaving Sepultura. The band\'s original lyrical content revolved around spirituality, political and religious themes, with later albums encompassing other themes including war, violence, aggression, slavery, hatred and anger. Soulfly incorporates many styles of metal with Brazilian tribal and world music. All of their first six studio albums debuted on the United States "Billboard" 200, with a peak position at number 32 for their second album, "Primitive". "Soulfly" has been certified gold by the Recording Industry Association of America. The band has gone through numerous line-up changes, with Cavalera being the only constant member. To date the band has released ten studio albums, one tour EP, twenty-three singles, one video album, and twelve music videos. Their debut album, "Soulfly", was released on April 21, 1998, while their newest album, "Archangel", was released on August 14, 2015.', 'title': 'Soulfly discography'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Massimiliano Antonio "Max" Cavalera (] , born August 4, 1969) is a Brazilian singer, guitarist, and songwriter who currently plays in heavy metal bands Soulfly, Cavalera Conspiracy, and Killer Be Killed. In 1984, he co-founded the acclaimed heavy metal band Sepultura with his brother Igor Cavalera and was the band\'s lead singer and rhythm guitarist until he left in 1996. Cavalera was also involved in a short-lived side project called Nailbomb.', 'title': 'Max Cavalera'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Soulfly is the self-titled debut album by the metal band Soulfly, released on April 21, 1998 through Roadrunner Records. The record was released in memory of frontman Max Cavalera\'s murdered stepson and the first album featuring Cavalera since leaving Sepultura two years prior. Both CDs have the message "In Loving Memory Dana" printed across them. The album has been certified gold by the RIAA.', 'title': 'Soulfly (album)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Tree of Pain" is a song by heavy metal band Soulfly, released in 2002 as the seventh track of the studio album numerically titled "3". Like most other songs, "Tree of Pain" has never been released as a single. This song is unique for Soulfly that it contains a pop ballad and a woman singer. This song tributes Max Cavalera for his stepson\'s (Dana Wells\') untimely death.', 'title': 'Tree of Pain'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Tribe" is the fourth single by metal band Soulfly, released in January 1999. It is played as the ninth track of the eponymous debut album "Soulfly", after "Bleed" and before "Bumba". "Tribe" is the fourth and last single of the album. As with every other Soulfly songs with vocals, the lyrics were written by Max Cavalera.', 'title': 'Tribe (song)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Eye for an Eye" is the first single by metal band Soulfly, released in 1998. The song is the first track of the debut album "Soulfly". However, "Eye for an Eye" is the tenth single written by Max Cavalera overall. His last single was Sepultura\'s "Ratamahatta" before he left the band and formed Soulfly. It has become Soulfly\'s trademark song, and is used at the closing of every Soulfly show since 1998.', 'title': 'Eye for an Eye (song)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Michael William Byrne (born February 6, 1990) is a drummer who was a member of the band The Smashing Pumpkins. When Pumpkins frontman Billy Corgan called for rehearsals to replace Jimmy Chamberlin, Byrne auditioned and was chosen out of thousands of applicants. He played drums in Sky Saxon tribute band Spirits in the Sky for 6 shows in August 2009, along with Corgan, Kerry Brown, Kevin Dippold, Mark Tulin, Linda Strawberry, Ysanne Spevack, Mark Weitz, and Dave Navarro, and also performs drums on the ongoing Pumpkins 44-song project, "Teargarden by Kaleidyscope". As a part of "Teargarden", Mike contributed drumming duties on "Oceania", the Pumpkins\' eighth full-length album. On April 17, 2010, Byrne played his first show under the Smashing Pumpkins moniker in celebration of Record Store Day.', 'title': 'Mike Byrne (musician)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Offspring is an American rock band from Garden Grove, California, formed in 1984. Originally formed under the name Manic Subsidal, the band has consisted of lead vocalist and rhythm guitarist Dexter Holland, bassist Greg K., lead guitarist Kevin "Noodles" Wasserman and drummer Pete Parada since 2007. While Holland, Greg K., and Noodles have been constant members since the band was formed, the Offspring has gone through a number of drummers. Their longest-serving drummer was Ron Welty, who had been a member of The Offspring for 16 years; he was replaced by Atom Willard in 2003, and then four years later by Parada. The band is often credited—alongside fellow California punk bands Green Day, Bad Religion, NOFX, Pennywise and Rancid—for reviving mainstream interest in punk rock in the 1990s. They have sold over 40 million records worldwide, being considered one of the best-selling punk rock bands of all time.', 'title': 'The Offspring'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Rotten Apples (The Smashing Pumpkins - Greatest Hits as titled on the album\'s cover) is a greatest hits compilation album by alternative rock band The Smashing Pumpkins. In the US, it was released in 2001 along with a bonus disc titled "Judas O". The album\'s concluding track, "Untitled", was the Pumpkins\' final recording before their breakup. Completed in the days leading up to the band\'s farewell concert at the Metro in Chicago, it was also released as a single. Another notable track is "Real Love"; while previously released on "Machina II/The Friends & Enemies of Modern Music", this was taken from the factory master tapes and, as a result, lacks the pops and clicks inherent in all copies of "Machina II" (which is vinyl sourced).', 'title': 'Rotten Apples'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Son Of Sam/Bombs Over Broadway is Violent Soho\'s third EP. Produced by Gil Norton and mixed by Rich Costey, it was released on 10 May 2010 on Thurston Moore\'s Ecstatic Peace! label. The Norman Records review called the EP a "fiendish mixture of The Towers of London and The Offspring." Comparisons were made with Smashing Pumpkins, both favorable and unfavorable. Soundblab said that "their gloom laden guitars and wincing screeches - a la Smashing Pumpkins circa Mellon Collie - have been done better before." However, Uber Rock called Son Of Sam "the sort of three-minute anthem Billy Corgan would once have written before he disappeared into the O in his Zero T shirt," and declared Bombs Over Broadway to be a "caustic mix of The Pixies, with its chugging verse, before breaking into the type of riotous chorus that fellow countrymen The Living End have made their trademark."', 'title': 'Son of Sam/Bombs Over Broadway'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'James Joseph Chamberlin (born June 10, 1964) is an American drummer and record producer. He is best known as the drummer for the alternative rock band The Smashing Pumpkins. Following the 2000 breakup of the band, Chamberlin joined Pumpkins frontman Billy Corgan in the supergroup Zwan and also formed his own group, the Jimmy Chamberlin Complex. In 2005, Chamberlin joined Corgan in reforming The Smashing Pumpkins; he eventually left the group in March 2009, though he returned again in 2015 for a summer tour. He performed in the group Skysaw until 2012. He is currently active under the Jimmy Chamberlin Complex name. In addition to his current work as CEO, Chamberlin has joined Chicago jazz saxophonist Frank Catalano for a string of 2013–15 performances in the Chicago area. An EP by Catalano and Chamberlin "Love Supreme Collective - EP" was released on the 29th of July 2014.', 'title': 'Jimmy Chamberlin'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"Range Life" is a song by Pavement, the third single from their 1994 album "Crooked Rain, Crooked Rain". The song attracted attention with controversial lyrics that seemed to mock alternative rock superstars the Smashing Pumpkins and the Stone Temple Pilots; Pumpkins frontman Billy Corgan expressed his displeasure in magazine interviews, while songwriter Stephen Malkmus maintained that his words had been misinterpreted and no insult was intended. Regardless, Pavement, which was due to tour for Lollapalooza in 1994, got kicked out when the Smashing Pumpkins, the headlining act, threatened to cancel their Lollapalooza dates if Pavement played. Pavement would eventually play Lollapalooza the next year. An early 1993 demo of the song did not feature this verse; guitarist Spiral Stairs recalled in 2004 that when Malkmus first revealed these new lyrics to his bandmates at the New York City recording sessions for "CRCR", "we almost lost our lunch from laughing so much." The single was not commercially released in the USA; it was issued by the band\'s UK label at the time, Big Cat. Both B-sides are outtakes from the "Crooked Rain, Crooked Rain" sessions and are included on the 2004 of that album. This song was one of many to be included in the group\'s greatest hits album "".', 'title': 'Range Life (song)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The Smashing Pumpkins are an alternative rock band formed in Chicago, Illinois in 1988. The band was formed by guitarist/vocalist Billy Corgan and guitarist James Iha after the demise of Corgan's first band, The Marked. Since its inception, The Smashing Pumpkins has gone through multiple line-up changes, with Corgan the only consistent member.", 'title': 'List of the Smashing Pumpkins band members'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "The Smashing Pumpkins are an American alternative rock band from Chicago, Illinois, formed in 1988. Formed by frontman Billy Corgan (lead vocals, guitar) and James Iha (guitar), the band included D'arcy Wretzky (bass guitar) and Jimmy Chamberlin (drums) in its original incarnation. It has undergone many line-up changes over the course of its existence, with the current lineup being Corgan and rhythm guitarist Jeff Schroeder.", 'title': 'The Smashing Pumpkins'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'William Patrick "Billy" Corgan Jr. (born March 17, 1967) is an American musician, songwriter, producer, poet, and entrepreneur. He is best known as the lead singer, primary songwriter, guitarist, and sole permanent member of The Smashing Pumpkins. Formed by Corgan and guitarist James Iha in Chicago, Illinois, in 1988, the band quickly gained steam with the addition of bassist D\'arcy Wretzky and drummer Jimmy Chamberlin. Strong album sales and large-scale tours propelled the band\'s increasing fame in the 1990s until their break-up in 2000. Corgan started a new band called Zwan, and after their quick demise, he released a solo album ("TheFutureEmbrace") and a collection of poetry ("Blinking with Fists") before setting his sights on reforming Smashing Pumpkins.', 'title': 'Billy Corgan'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"1979" is a song by American alternative rock band the Smashing Pumpkins. Released in 1996 as the second single from their third studio album, "Mellon Collie and the Infinite Sadness", "1979" was written by frontman Billy Corgan, and features loops and samples that were uncharacteristic of previous Smashing Pumpkins songs. The song was written as a coming of age story by Corgan. In the year 1979, Corgan was 12 and this is what he considered his transition into adolescence. The song was popular with critics and fans; Allmusic\'s Amy Hanson called it a "somewhat surprising hit". The song was nominated for the Record of the Year and Best Rock Performance by a Duo or Group with Vocal at the 39th Annual Grammy Awards, and won an MTV Video Music Award for Best Alternative Video. In 2012, it was voted the second-best Smashing Pumpkins song by Rolling Stone magazine readers.', 'title': '1979 (song)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'San Angelo Regional Airport (IATA: SJT,\xa0ICAO: KSJT,\xa0FAA LID: SJT) , also known as Mathis Field, is a public airport serving the city of San Angelo, in Tom Green County, Texas, USA. The airport covers 1503 acre and has three runways. The airport also offers free parking.', 'title': 'San Angelo Regional Airport'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'O.C. Fisher Reservoir (also known as O.C. Fisher Lake, formerly known as San Angelo Lake) is an artificial lake located west of the city of San Angelo, Texas. With the financial support of the Upper Colorado River Authority, construction on the dam to form the reservoir was begun by the United States Army Corps of Engineers in 1947 and the lake was officially impounded in 1952. Originally named San Angelo Lake, the reservoir was renamed in 1975 for local U.S. Congressman O.C. Fisher, to honor his 23 years of service in the United States Congress.', 'title': 'O.C. Fisher Reservoir'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Grand Junction Regional Airport (IATA: KGJT,\xa0ICAO: GJT) is a public airport three miles northeast of Grand Junction, in Mesa County, Colorado. Owned by the Grand Junction Regional Airport Authority, it is the largest airport in western Colorado and third largest in the state, behind Denver International Airport and Colorado Springs Airport.', 'title': 'Grand Junction Regional Airport'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Ute meridian, also known as the Grand River meridian, was established in 1880 and is a principal meridian of Colorado. The initial point lies inside the boundaries of Grand Junction Regional Airport, Grand Junction, Colorado.', 'title': 'Ute meridian'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'KSJT-FM (107.5 FM) is a radio station broadcasting a Spanish music format. Currently known as "K-107 La Grande", KSJT began in 1985 at a facility on Oakes St. in San Angelo and later moved studios to the current location, 209 W. Beuaregard. Licensed to San Angelo, Texas, United States, the station serves the San Angelo area. The station is currently owned by La Unica Broadcasting Co. .', 'title': 'KSJT-FM'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The city of Grand Junction is the home rule municipality that is the county seat and the most populous municipality of Mesa County, Colorado, United States. The city has a council–manager form of government, and is the most populous municipality in all of western Colorado. Grand Junction is situated 247 mi west-southwest of the Colorado State Capitol in Denver. As of the 2010 census, the population of the city was 58,566. Grand Junction is the 15th most populous city in the state of Colorado and the most populous city on the Colorado Western Slope. Grand Junction serves as a major commercial and transportation hub within the large area between the Green River and the Continental Divide. It is the principal city of the Grand Junction Metropolitan Statistical Area which had a population of 146,723 in 2010 census.', 'title': 'Grand Junction, Colorado'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The San Angelo Sheep Herders were a West Texas League baseball team based in San Angelo, Texas, United States that played in 1929. They were the last team to play in San Angelo until the San Angelo Colts came about in 1948.', 'title': 'San Angelo Sheep Herders'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'San Angelo is a city in and the county seat of Tom Green County, Texas, United States. Its location is in the Concho Valley, a region of West Texas between the Permian Basin to the northwest, Chihuahuan Desert to the southwest, Osage Plains to the northeast, and Central Texas to the southeast. According to a 2014 Census estimate, San Angelo has a total population of 100,450. The city is the principal city and center of the San Angelo metropolitan area, which has a population of 118,182.', 'title': 'San Angelo, Texas'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Elizabeth City Regional Airport (IATA: ECG,\xa0ICAO: KECG,\xa0FAA LID: ECG) is a joint civil-military public and military use airport located three\xa0nautical miles (6\xa0km) southeast of the central business district of Elizabeth City, in Pasquotank County, North Carolina, United States. The airport, on the shore of the Pasquotank River, is also known as Elizabeth City-Pasquotank County Regional Airport or ECG Regional Airport. It is included in the National Plan of Integrated Airport Systems for 2011–2015, which categorized it as a "general aviation" facility.', 'title': 'Elizabeth City Regional Airport'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The San Angelo Red Snappers were a West Texas League baseball team based in San Angelo, Texas, United States that played in 1928, winning the league championship that year under manager Red Snapp. The team became the San Angelo Sheep Herders in 1929.', 'title': 'San Angelo Red Snappers'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Westley Sissel Unseld (born March 14, 1946) is an American former basketball player. He spent his entire NBA career with the Baltimore/Capital/Washington Bullets, and was inducted into the Naismith Memorial Basketball Hall of Fame in 1988.', 'title': 'Wes Unseld'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The 1959 NBA World Championship Series was the championship series of the 1958–59 National Basketball Association season, and was the conclusion of the 1959 NBA Playoffs. The best-of-seven series was played between the Western Division champion Minneapolis Lakers and the Eastern Division champion Boston Celtics. It was Boston's third trip to the NBA Finals and Minneapolis's sixth. The Boston Celtics swept the Lakers 4–0. That was the start of the Celtics' 8 consecutive championships, from 1959–1966. To date, this is the most recent time that an NBA team from Minnesota appeared in an NBA Finals, as well as the first of two times in NBA history that a team with a losing record made the NBA Finals (the other was in 1981).", 'title': '1959 NBA Finals'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The 1958 NBA World Championship Series was the championship series for the 1957–58 National Basketball Association (NBA) season, and the conclusion of the season's playoffs. It pitted the Western Division champion St. Louis Hawks against the Eastern Division champion Boston Celtics. The Hawks won the series in six games to win the club's first and so far only NBA championship title.", 'title': '1958 NBA Finals'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The 1961 NBA World Championship Series was the championship round of the 1961 NBA Playoffs, which concluded the National Basketball Association (NBA)'s 1960–61 season. The best-of-seven series was played between the Western Conference champion St. Louis Hawks and the Eastern Conference champion Boston Celtics. This was the fourth and final World Championship Series meeting between the two teams. It was also Celtics' fifth straight trip to the championship series, and they won the series against the Hawks, 4–1.", 'title': '1961 NBA Finals'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': "The 1978 NBA World Championship Series was the championship round of the National Basketball Association (NBA)'s 1977–78 season, and the culmination of the season's playoffs. The series featured the Western Conference champion Seattle SuperSonics against the Eastern Conference champion Washington Bullets. The Bullets defeated the SuperSonics in seven games to win the NBA championship. Bullets power forward/center Wes Unseld was named MVP of the series. Before the Cleveland Cavaliers' Game 7 win at Golden State in the 2016 NBA Finals, this was the last time a road team had won Game 7 in the NBA Finals. The 1978 Finals is the only NBA Finals series since the 1958 NBA Finals in which both teams had under 50 wins. The 1979 Finals are the only NBA Finals to feature two teams with under 50 wins in an 82-game season.", 'title': '1978 NBA Finals'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The 1970 NBA World Championship Series was the championship series of the 1970 NBA Playoffs, which concluded the 1969–70 National Basketball Association (NBA) season. The Eastern Division champion New York Knicks defeated the Western Division champion Los Angeles Lakers in a best-of-seven series 4 games to 3 for their first NBA title.', 'title': '1970 NBA Finals'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The 1957 NBA World Championship Series was the championship series of the 1956–57 National Basketball Association season, and was the conclusion of the 1957 NBA Playoffs. The best-of-seven series was played between the Western Division champion St. Louis Hawks and the Eastern Division champion Boston Celtics. This was the first trip to the Finals for each team, the first Finals in which both teams competing were making their first appearances since 1951. The Celtics won the series over the Hawks, 4–3. It remains the only Game 7 in NBA history to be decided in double-overtime.', 'title': '1957 NBA Finals'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The 1979 NBA World Championship Series was the championship series played at the conclusion of the National Basketball Association (NBA)'s 1978–79 season. The Western Conference champion Seattle SuperSonics played the Eastern Conference champion Washington Bullets, with the Bullets holding home-court advantage, due to a better regular season record. The SuperSonics defeated the Bullets 4 games to 1. The series was a rematch of the 1978 NBA Finals, which the Washington Bullets had won 4–3.", 'title': '1979 NBA Finals'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 1973 NBA World Championship Series was the championship series of the 1972–73 National Basketball Association (NBA) season, and the culmination of that season's playoffs. The Eastern Conference champion New York Knicks defeated the Western Conference champion Los Angeles Lakers 4 games to 1. The series was an exact reversal of the prior year, with the Lakers winning Game 1 and the Knicks taking the next four games. Knicks center Willis Reed was named as the NBA Finals MVP.", 'title': '1973 NBA Finals'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The 1967 NBA World Championship Series was the championship series of the 1966–67 National Basketball Association (NBA) season, and was the conclusion of the 1967 NBA Playoffs. The best-of-seven series was played between the Western Conference champion San Francisco Warriors and the Eastern Conference champion Philadelphia 76ers. This was the first championship series in 11 years without the Boston Celtics, who were defeated in the Division Finals by Philadelphia.', 'title': '1967 NBA Finals'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Brad Alexander (born February 2, 1971) is an American songwriter and musical theater composer, most notably of the musical "See Rock City & Other Destinations", which won the 2011 Drama Desk Award for Outstanding Book of a Musical, the Richard Rodgers Award and the BMI Foundation’s Jerry Bock Award. He wrote the music and orchestrations for Theatreworks USA’s "Click, Clack, Moo", which premiered Off-Broadway at the Lucille Lortel Theater and received a Drama Desk Award nomination for Outstanding Lyrics and Lucille Lortel Award nominations for Outstanding Choreographer, Outstanding Lyrics and Outstanding Musical. His songs have been featured on Sony Records, Select Records, Showtime’s The L Word, VH1\'s “Celebreality” campaign, Sirius XM Radio and web series Submissions Only. He is a member of the Songwriters Hall of Fame, National Alliance for Musical Theatre, Dramatists Guild of America and member Emeritus of The BMI Lehman Engel Musical Theatre Workshop. He is married to actress and writer Jill Abramovitz.', 'title': 'Brad Alexander'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'This is a list of winners of the Drama Desk Award for Outstanding Director introduced in 1955 to honour directors of plays and directors of musicals. From 1968, multiple awards were presented for each season. In 1975 the category was retired and divided into Drama Desk Award for Outstanding Director of a Play and Drama Desk Award for Outstanding Director of a Musical, with each discipline receiving its own.', 'title': 'Drama Desk Award for Outstanding Director'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Drama Desk Award for Outstanding Solo Performance is an annual award presented by Drama Desk in recognition of achievements in the theatre among Broadway, Off Broadway and Off-Off Broadway productions. The category was first presented at the 1984 ceremony, when it was known as the Drama Desk Award for Outstanding One-Person Show. The award has been known by its current name since 1999.', 'title': 'Drama Desk Award for Outstanding Solo Performance'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Gerard Alessandrini (born November 27, 1953) is an American playwright, parodist, actor and theatre director best known for creating the award-winning off-Broadway musical theatre parody revue "Forbidden Broadway". He is the recipient of Tony Honors for Excellence in Theatre, an Obie Award, four Drama Desk Awards (including the Drama Desk Award for Outstanding Lyrics and the Drama Desk Special Award), an Outer Critics Circle Award, and two Lucille Lortel Awards, as well as the Drama League Award for Lifetime Achievement in Musical Theatre.', 'title': 'Gerard Alessandrini'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Laura Ann Osnes (born November 19, 1985) is an American actress and singer known for her work on the Broadway stage. She has played starring roles in "Grease" as Sandy, "South Pacific" as Nellie Forbush, "Anything Goes" as Hope Harcourt, and "Bonnie and Clyde" as Bonnie Parker, for which she received a Tony Award nomination for Best Actress in a Musical. She also starred in the title role of Rodgers & Hammerstein\'s "Cinderella" on Broadway, for which she received a Drama Desk Award and her second Tony Award nomination for Best Actress in a Musical.', 'title': 'Laura Osnes'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Nick Cordero is a Canadian actor. He appeared on Broadway in 2014 in the musical "Bullets Over Broadway" in the role of Cheech, for which he was nominated for the Tony Award for Best Featured Actor in a Musical and the Drama Desk Award for Outstanding Featured Actor in a Musical. He won the Outer Critics Circle Award for Outstanding Featured Actor in a Musical and a Theater World Award for the role. He originated the title role in the Off-Broadway production of "The Toxic Avenger". He also played the role of Dennis in "Rock of Ages" on Broadway in 2012 and on tour. In March 2016, he joined the Broadway production of "Waitress", playing the role of Earl. He left "Waitress" to join the Broadway premier of the musical "A Bronx Tale", as "Sonny" at the Longacre Theatre starting on November 3, 2016.', 'title': 'Nick Cordero'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Kenneth Posner is an American theatrical lighting designer, working on Broadway, Off-Broadway, and in American regional theatre. His most notable designs include the musicals "Wicked" and "Hairspray", two highly regarded musicals of the early 21st century. He has been nominated for the Tony Award for Best Lighting Design 10 times, including nods for "Merchant of Venice" (2011), "The Coast of Utopia" (2007), "Dirty Rotten Scoundrels" (2005), "Wicked" (2004), "Hairspray" (2003), and "The Adventures of Tom Sawyer" (2001). He has also been nominated 10 times for the Drama Desk Award for Outstanding Lighting Design, and won both the Tony and Drama Desk award in 2007 for "The Coast of Utopia". He also has received an Obie Award for Sustained Excellence in Lighting. He also designed the lights for "Little Women".', 'title': 'Kenneth Posner'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '9 to 5: The Musical is a musical based on the 1980 movie of the same name, with music and lyrics by Dolly Parton. It features a book by Patricia Resnick, based on the screenplay by Resnick and Colin Higgins. The musical premiered in Los Angeles in September 2008, and opened on Broadway in April 2009. It received 15 Drama Desk Award nominations, the most received by a production in a single year, as well as four Tony Awards nominations. The Broadway production however was short-lived, closing in September 2009. A national tour of the US launched in 2010, followed by a UK premiere in 2012 and returns to the UK in 2017 in a new production at The Gatehouse in London with a West End cast, as part of a fringe festival.', 'title': '9 to 5 (musical)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Grease: The New Broadway Cast Recording is the cast album for the 2007 Broadway production of the hit musical, "Grease". The show, directed by Tony Award-winner Kathleen Marshall, played at the Brooks Atkinson Theatre in New York City. This recording features performances from the cast of "Grease" including Jenny Powers, Matthew Saldivar, and "" winners, Laura Osnes and Max Crumm as Sandy Dumbrowski and Danny Zuko, respectively.', 'title': 'Grease: The New Broadway Cast Recording'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Open Admissions is a play in two acts by Shirley Lauro that premiered in 1982 at the Long Wharf Theatre under the direction of Arvin Brown. The play had its Broadway debut on January 29, 1984 at the Music Box Theatre where it ran for a total of 17 performances. The Broadway production starred Calvin Levels as Calvin Jefferson, Marilyn Rockafellow as Ginny Carlsen, Nan-Lynn Nelson as Salina Jones, Pam Potillo as Georgia Jones, and Sloane Shelton as Professor Clare Block. The play depicts the travails of a professor at a second-rate college, including an unsupportive husband. Levels won a Theatre World Award and was nominated for both a Tony Award and Drama Desk Award for his performance. Rockafellow also received a Drama Desk Award nomination. On Broadway, "Open Admissions" received a Theatre World Award, The Dramatists Guild Hull-Warriner Award.', 'title': 'Open Admissions'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Climbing! , also known as Mountain Climbing! , is the official debut studio album by American blues rock band Mountain. Released on March 7, 1970, the album featured the \'classic\' Mountain lineup of Leslie West (guitar, vocals), Felix Pappalardi (bass, vocals, piano), Corky Laing (drums, percussion) and Steve Knight (keyboards) and followed the West solo album "Mountain" featuring Pappalardi and drummer Norman Smart, released in 1969 and often credited to the band. Produced by Pappalardi, the album reached number 17 on the American "Billboard" 200 albums chart and featured the band\'s best-known song, "Mississippi Queen". An early rendition of "For Yasgur\'s Farm" was actually performed at the Woodstock Festival in August 1969 as Who Am I But You And The Sun. It was subsequently recorded and retitled for the album.', 'title': 'Climbing!'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Stephani Danelle Perry (credited as S. D. Perry in her works) is an American novelist. She is the daughter of writer Steve Perry.', 'title': 'S. D. Perry'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'For the Love of Strange Medicine is the second studio album by Steve Perry, released on July 19, 1994 through Columbia Records. After a lengthy 8-year hiatus following the breakup of Journey, Perry returned to the spotlight with this album. The first single "You Better Wait" received major radio airplay and reached the top 10 on the Billboard Mainstream Rock chart in the U.S. The album was followed by a tour in 1994-1995. "For the Love of Strange Medicine" was certified as gold by the Recording Industry Association of America (RIAA) for shipments of 500,000 units in the United States, as of September 1994.', 'title': 'For the Love of Strange Medicine'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Leslie West Live! is a live album by Leslie West, released in 1993.', 'title': 'Leslie West Live!'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Arrival is the eleventh studio album by the American rock band Journey, released in the United States in 2001. A version with one substituted song was released in Japan in 2000. The album was the band's first full-length studio album with new lead vocalist Steve Augeri, who replaced popular frontman Steve Perry, and with Deen Castronovo, who replaced Steve Smith as the band's drummer.", 'title': 'Arrival (Journey album)'}
