 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Leslie West (born Leslie Weinstein; October 22, 1945) is an American rock guitarist, vocalist, and songwriter. He is best known as a founding member of the hard rock band Mountain.', 'title': 'Leslie West'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Tyler Drew Morris is an American professional guitar player who was born in Boston, Massachusetts. Morris has performed with Yngwie Malmsteen, Steve Vai, Gary Hoey, Joe Stump, Sammy Hagar, Leslie West, Rudy Sarzo, Vince Neil, Joe Vitale, Johnny Winter, James Montgomery, David Hull, Phil Collen, Fred Coury, Robert Marcello, Kip Winger, AJ Pappas, Jimi Bell, Gary King, George Lynch, Bruce Kulick, Jason Becker, Vernon Reid, Jeff "Skunk" Baxter, Ronnie Montrose and others. Morris does demonstrations for Fishman Electronics, Dean Guitars, and REVV Amplification among other companies at the annual summer and winter NAMM shows. At the age of 15, Morris wrote his first studio album, "And So It Begins". This album was later featured in "Guitar Player Magazine", "Vintage Guitar Magazine", "Heavy Riff Magazine", Korea Guitar, and other worldwide media outlets. He has performed at venues including Mechanic\'s Hall, The Larcom Theater, Tupelo Music Hall, The House of Blues in Los Angeles, B. B. King\'s Blues Club in New York City and in West Palm Beach, The Miami Beach Bandshell, The Regent Theater, The Cutting Room, The Hard Rock Cafe and many other venues all across the United States.', 'title': 'Tyler Morris'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Step Back is an album by blues guitarist and singer Johnny Winter. It features performances by a number of guest musicians, including Eric Clapton, Dr. John, Billy Gibbons from ZZ Top, Joe Perry from Aerosmith, Leslie West from Mountain, and Brian Setzer from the Stray Cats. It was released by Megaforce Records on September 2, 2014.', 'title': 'Step Back (album)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "Stephen Henry Perry (born October 8, 1963) is an American musician, best known as lead singer, songwriter and rhythm guitarist for the Oregon ska-swing band the Cherry Poppin' Daddies.", 'title': 'Steve Perry (Oregon musician)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': '"Sweet Baby" is the debut single by Argentine pop band Erreway from their debut album "Señales". It was released through Sony Music in 2002 (see 2002 in music). The single, which features all four members — Felipe Colombo, Benjamín Rojas, Camila Bordonaba and Luisana Lopilato — was written by recognized Argentine director, producer and composer Cris Morena.', 'title': 'Sweet Baby (Erreway song)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Romina Yankelevich (5 September 1974 – 28 September 2010), better known as Romina Yan, was an Argentine actress, screenwriter, singer and dancer. She made her television debut in the program "Jugate Conmigo", and is most known for her portrayal of Belén Fraga in the internationally successful series "Chiquititas" (as well as on stage, in its annual musical presentations) created by her mother Cris Morena. She died in 2010, aged 36, after suffering a heart attack.', 'title': 'Romina Yan'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Milagros Urién, simply known as Mili, is a fictional character and the young protagonist of the Argentine telenovela "Chiquititas", also known as "Tiny Angels". The character was portrayed by actress Agustina Cherri from 1995 to 1997 on television and on stage. In 1998, Cherri won a Martín Fierro Award of Best Child Performance for her portrayal of the character In 2001, Cherri made a special return as Mili for the show\'s seventh and final season. Mili was portrayed by actress Fernanda Souza in the successful Brazilian adaptation of the story, "Chiquititas Brasil", where the character is named Milena Pereira. Ixchel del Paso portrayed Mili in the short-lived Mexican version. Mili is portrayed by Giovanna Grigio in the 2013 Brazilian series "Chiquititas".', 'title': 'Mili Urién'}
