[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The 1953 William & Mary Indians football team represented William & Mary during the 1953 college football season. The team is considered, within the school\'s community, to be one of the most remarkable stories in its athletics history. Due to an academic cheating scandal (coincidentally unrelated to the 1951 scandal), eight of the team\'s starting members were dismissed from school and another portion of the remaining 33 players transferred out. Among the 24 remaining players, five were returning Korean War veterans and one other had never played a minute of football in his life. Many of them were undersized (the quarterback stood 5\'8" and weighed 160 pounds) and even the coaching staff was few in numbers (five total, one of them being the head basketball coach).', 'title': '1953 William &amp; Mary Indians football team'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 1948 William & Mary Indians football team represented William & Mary during the 1948 college football season. The William & Mary Indians finished the regular season ranked #17 in the AP Poll after their 9–0 win over Arkansas. Also notably, Indians tied #3\xa0North Carolina 7–7 in Chapel Hill.', 'title': '1948 William &amp; Mary Indians football team'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The 1970 William & Mary Indians football team represented William & Mary during the 1970 college football season. When William & Mary played the 20th-ranked West Virginia Mountaineers on September 12, it marked the first game as future college football legend Bobby Bowden's career as the Mountaineers' head coach. Bowden coached West Virginia from 1970–1975, going 3–0 against the Indians (Tribe) in the process.", 'title': '1970 William &amp; Mary Indians football team'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "The 1959 William & Mary Indians football team represented William & Mary during the 1959 college football season. The September 26th contest against the #13 Naval Academy marked the inaugural game in the brand new Navy–Marine Corps Memorial Stadium, which replaced Thompson Stadium as the location for all of Navy's future home games. William & Mary would go on to lose the game, 2–29.", 'title': '1959 William &amp; Mary Indians football team'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The 1947 William & Mary Indians football team represented William & Mary during the 1947 college football season. The William & Mary Indians finished the regular season ranked #14 in the AP Poll after their 35–0 win over Richmond.', 'title': '1947 William &amp; Mary Indians football team'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Navy–Marine Corps Memorial Stadium is an open-air stadium located on the campus of the United States Naval Academy in Annapolis, Maryland. Opened in 1959, it serves as the home stadium of the Navy Midshipmen college football and lacrosse, and the professional Chesapeake Bayhawks of Major League Lacrosse. The stadium is also the host of the Military Bowl.', 'title': 'Navy–Marine Corps Memorial Stadium'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The 1957 William & Mary Indians football team represented William & Mary during the 1957 college football season. On November 9,\xa01957, William & Mary traveled to Raleigh, North Carolina to play #10\xa0ranked NC State in Riddick Stadium. The Indians\xa0(2–5–0) stunned the Wolfpack\xa0(5–0–2) with a\xa07–6\xa0win. The loss dropped NC State nine spots in the following AP Poll to #19. It marked the first time that William & Mary had ever defeated a national top\xa010\xa0opponent', 'title': '1957 William &amp; Mary Indians football team'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The 1965 William & Mary Indians football team represented William & Mary during the 1965 college football season. The October 2nd game versus the Virginia Tech Hokies signified the christening of VT's Lane Stadium. It was the first-ever varsity football game played in the new stadium. The Indians lost, however, 9–7.", 'title': '1965 William &amp; Mary Indians football team'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The 1949 William & Mary Indians football team represented the College of William & Mary in Williamsburg, Virginia during the 1949 college football season. The 1940s was the most successful decade in William & Mary football history. The Indians amassed more wins than any other decade (and this includes a non-existent 1943 season due to World War II), had the largest positive-point differential, won two conference championships and qualified for back-to-back bowl games in 1947 and 1948. There were 24 National Football League (NFL) Draft selections, which is the most all-time for William & Mary in a single decade. Additionally, the 1940s was the only decade in which William & Mary was an Associated Press nationally ranked team as a member of Division I-A.', 'title': '1949 William &amp; Mary Indians football team'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The 1935 William & Mary Indians football team represented William & Mary during the 1935 college football season. The opener against the Virginia Cavaliers was the first-ever game played at William & Mary's brand new Cary Field. The game ended in a 0–0 tie.", 'title': '1935 William &amp; Mary Indians football team'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Maltese Bippy is a 1969 film directed by Norman Panama and released by Metro-Goldwyn-Mayer. It stars Dan Rowan and Dick Martin.', 'title': 'The Maltese Bippy'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'John Dalli (born 5 October 1948) is a former Maltese politician who served as Cabinet Minister in various Maltese governments between 1987 and 2010. He was European Commissioner for Health and Consumer Policy between 2010 and 2012.', 'title': 'John Dalli'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Jarrod Sammut (born 15 February 1987) is an Australian professional rugby league footballer who currently plays for the London Broncos in the Championship. He previously played for the Penrith Panthers in the National Rugby League, Crusaders RL, the Bradford Bulls, the Wakefield Trinity Wildcats in the Super League, and Workington Town in League 1. Sammut is a dual-code international for Malta, having represented both the Maltese rugby league team and the Maltese rugby union team. He primarily plays at halfback or fullback.', 'title': 'Jarrod Sammut'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Emvin Cremona (27 May 1919 – 29 January 1987) was a Maltese artist and stamp designer. He is regarded as one of the best Maltese artists of the 20th century. Cremona is known for designing most Maltese stamps from 1957 to the 1970s, including the stamp issue commemorating Malta's independence from Great Britain in 1964. He studied at the Malta School of Arts and the Regia Accademia delle Belle Arti in Rome. Some of his works can be found at the parish churches of Msida and Ħamrun, Ta' Pinu Sanctuary and the Chapel of the Malta International Airport. The World Health Organization headquarters in Geneva and the United Nations Headquarters in New York also house paintings by Cremona.", 'title': 'Emvin Cremona'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Edoardo “Eddie” Fenech Adami, , (born 7 February 1934) is a Maltese politician and Nationalist politician who served as Prime Minister of Malta from 1987 until 1996, and again from 1998 until 2004. Subsequently, he was the seventh President of Malta from 2004 to 2009. He led his party to win five general elections, in 1981, 1987, 1992, 1998 and 2003. Staunchly pro-European, Fenech Adami is the longest serving Maltese prime minister since Malta's independence, and was fundamental for Malta's accession to the European Union.", 'title': 'Eddie Fenech Adami'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Sebastian Calleja (born 3 July 1998) is a Maltese singer. He started his singing career at the age of 11. He studied voice and in March 2016 he placed 1st in the Trinity College of London vocal exam. His vocal coach is Glen Vella. Calleja is a resident singer on 'Hadd Ghalik' which is aired on the national Maltese television channel TVM. He also played main roles in various musicals on the local stage, including 'Aida', 'Rumpilstilskin', 'Barnuza Blu', 'Katrin tal-Imdina', 'The Pantomime Sossy u Tezor Mitluf', 'Carmen', 'Dracula' and 'Star Child'. In 2016, he also was chosen (together with other 5 local singers) to be part of the song and music video for the Maltese version of the World Youth Day Song 2016 - 'Henjin li jhennu'.", 'title': 'Sebastian Calleja'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Mosta Football Club is a Maltese football club from the town of Mosta. The team played four seasons in Malta's highest league 1974–75, 1987–88, 2002–03 and 2005–06. They achieved promotion to the Maltese Premier League again in 2010–11.", 'title': 'Mosta F.C.'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Konkors Kanzunetta Indipendenza ("Independence Song Contest") is Maltese festival held on a day near September 21 (Malta\'s independence day). All songs are interpreted in the Maltese language and is one of the most anticipated events on the Maltese musical calendar. The event first took place back in 1983 in a span of four years until 1987 before returning just 10 years later in 1997 going on to take place each and every year since then. Several local stars like to submit their entries into such a prestigious musical event due to the fact that the songs are written in Maltese. In recent years there were a number of winners who went on to be successful both locally and abroad. Below you could find the list of the past winners', 'title': 'Festival Kanzunetta Indipendenza'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'John Matthew Rispoli (17 August 1582 – 6 April 1639) was a major Maltese philosopher of great erudition. He was held in high esteem by the Grand Masters of the Knights Hospitaller Order, the Bishops of Malta, the Viceroys of Sicily, cardinals, bishops, inquisitors, and the common people. Perhaps the most eminent Maltese philosopher of the Middle Ages, the various extant writings of his are witness to his philosophical aptitude and dexterity as to his high calibre as a philosopher. These qualities were highly appreciated during his lifetime, in Malta as in France and Italy. He lived a busy life, both as an intellectual and as an administrator. He was professor of philosopher at various institutions of high education, an able preacher, and an official at various posts within the Dominican Order, of which his was a member. He was an avid aficionado of music, and was talented with playing musical instruments. Though the fame of holiness accompanied him in his life, this did not deter the Inquisition from suspecting him of heresy, and keeping him in its dungeons for fourteen months. When he died, he was given an almost state funeral.', 'title': 'John Matthew Rispoli'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Daniel Hale "Dan" Rowan (July 22, 1922 – September 22, 1987) was an American comedian. He was featured in the television show "Rowan & Martin\'s Laugh-In", where he played straight man to Dick Martin, and won the 1969 Emmy for Outstanding Variety or Musical Series.', 'title': 'Dan Rowan'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Tapas Relia (Gujarati: તપસ રેલિયા ; born August 11, 1978) is an Indian music composer and producer, known for his famous advertising campaigns for brands like Close-Up (toothpaste), Domino's Pizza, Amaron Batteries, IPL and Mahabharat (2013 TV series). In Mumbai since 1996, he has also scored music for Bollywood films, including India’s first major commercial animation film ‘Hanuman (2005 film)’ and the recently released film ‘Lakshmi (2014 film)’, a film on child trafficking by acclaimed director Nagesh Kukunoor. Based in Mumbai, he works and operates from his own recording studio.", 'title': 'Tapas Relia'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'RVK Studios is an Icelandic film production company. It superseded Blueeyes Productions by making all future productions from now on. The company’s director and chairman of the board is Baltasar Kormákur who is a highly acclaimed director, writer and producer on an international scale. RVK Studios mainly creates Icelandic drama movies and TV shows for an international audience.', 'title': 'RVK Studios'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Remedy is an 2005 American crime drama directed by Christian Maelen and written by Sandy Eiges, Nicholas Reiner, and Charlotte Wise. The film stars Maelen, Arthur Nascarella, Jon Doscher, Frank Vincent, Vincent Pastore, and Chuck Zito.', 'title': 'Remedy (film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Cleaver is a metafictional film within a TV-series that serves as an important plot element toward the end of the HBO television drama series "The Sopranos". Although very little film material is actually shown in the series, its planning and development are discussed at large throughout multiple seasons of the show. The extent to which Sopranos character Christopher Moltisanti mixes confidential and personal information about the Soprano mob family into the story elements of Cleaver is the focal point throughout its development. After the project eventually materializes, Cleaver can be categorized as a direct-to-DVD mafia-slasher film, described alternately as ""Saw" meets "the Godfather II"", ""the Ring" meets "The Godfather"", and "a story about a young man who goes to pieces and then manages to pull himself together again". Several characters are credited for their involvement in the project. The screenplay was written by J. T. Dolan based on a story by Christopher Moltisanti, directed by Morgan Yam and produced by Carmine Lupertazzi, Jr. and Moltisanti. The film starred Jonathan LaPaglia as Michael "the Cleaver" and Daniel Baldwin as mob boss Salvatore ("Sally Boy"). Also starring as Sally-boy\'s key advisors are George Pogatsia as Frankie and Lenny Ligotti as Nicky. Moltisanti and Lupertazzi initially attempts to recruit Ben Kingsley to fill the role of the mafia don in "Luxury Lounge (6x07)," but Kingsley eventually turns down the part.', 'title': 'Cleaver (The Sopranos)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Las Vegas Mob Experience was located at the Tropicana on the Las Vegas Strip. The Las Vegas Mob Experience was a 27000 sqft interactive tour that chronicled the rise and fall of the Mafia in the Las Vegas Valley, mixing entertainment with history, storytelling, artifacts and technology. Visitors take a journeyed through the world of organized crime, interacting with live character actors and 3D holograms of famous mob movie icons and celebrity gangsters such as James Caan, Frank Vincent, Tony Sirico and Mickey Rourke.', 'title': 'Mob Attraction Las Vegas'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Viestur Kairish (Latvian: Viesturs Kairišs) (born January 30, 1971) is a Latvian opera, movie and theatre director. He has made a successful career in Latvia and Germany as an acclaimed director of operas. The movies and plays of Kairish have toured in many European festivals.', 'title': 'Viestur Kairish'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Tatsumi Kumashiro (神代 辰巳 , "Kumashiro Tatsumi" ) was a Japanese film director known for his critically acclaimed, award-winning "Roman Porno" films, such as "Ichijo\'s Wet Lust" (1972) and "The Woman with Red Hair" (1979). He was the most highly acclaimed director of the early Nikkatsu Roman Porno era, with many box-office successes, and films regularly appearing on the yearly Best Ten lists of the mainstream "Kinema Junpo" and "Eiga Geijutsu" film journals. Kumashiro has been called, "the most consistently successful director in Japan\'s cinematic history," and Allmovie calls him, "arguably the most important Japanese director to emerge during the 1970s."', 'title': 'Tatsumi Kumashiro'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Frank Vincent Gattuso Jr. (April 15, 1937 – September 13, 2017), known professionally as Frank Vincent, was an American actor. He played prominent roles in the HBO series "The Sopranos" and in several films for director Martin Scorsese: "Raging Bull" (1980), "Goodfellas" (1990), and "Casino" (1995).', 'title': 'Frank Vincent'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Carl Gustav, gjengen og parkeringsbandittene ("Carl Gustav, the Gang and the Parking Bandits") is a Norwegian children\'s mystery film from 1982. It is about 12-year-old Carl Gustav and his friends, who one day discover a playground has been converted to a parking lot. Several other playgrounds in suburban Bergen disappear. The film was directed by Ola Solum and featured Frank Arne Johansen in the lead role. The film was produced by Norsk Film and given a seven-year rating.', 'title': 'Carl Gustav, gjengen og parkeringsbandittene'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Pakshe (Malayalam: പക്ഷേ ; English: But ) is a 1994 Malayalam romantic drama film written by Cheriyan Kalpakavadi and directed by Mohan. It stars Mohanlal and Shobhana in the lead roles. Though a usually repeated story in Malayalam films, the director is successful in saying the story in the most heart-touchable way. The film was critically acclaimed and was a box-office success. Mohan is a critically acclaimed director in Malayalam film and has directed many classic movies such as "Isabella", "Edavela", "Angane Oru Avadhikkalathu" etc.', 'title': 'Pakshe'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Bauerfield International Airport (IATA: VLI,\xa0ICAO: NVVV) is an airport located in Port Vila, Vanuatu. The airport is relatively small in size, but its runway has the capability and length to accept jets up to the Airbus A330. It serves as the hub for Vanuatu's flag carrier airline, Air Vanuatu.", 'title': 'Bauerfield International Airport'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Champion Air was an airline based in Bloomington, Minnesota, USA. It operated general charter services to sports teams, vacation wholesalers and government agencies. It also offered limited scheduled service. Its main base was Minneapolis-Saint Paul International Airport, with hubs at Denver International Airport, Dallas-Fort Worth International Airport, Detroit Metropolitan Wayne County Airport, McCarran International Airport in Las Vegas, Lambert-St. Louis International Airport, and Will Rogers World Airport in Oklahoma City. The airline ceased all operations on May 31, 2008. Until its shutdown, the airline was a prime contractor for the Justice Prisoner and Alien Transportation System.', 'title': 'Champion Air'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The International Islamic Relief Organization (IIRO; Arabic: هيئة الإغاثة الإسلامية العالمية\u200e \u200e ), also known as the International Islamic Relief Organization of Saudi Arabia (IIROSA), is a charity based in Saudi Arabia founded by the Muslim World League in 1978. It is a full member of The Conference of NGOs, where it serves on the board. The IIRO is included in a list of some of the UNHCR's major NGO partners and has been involved in many joint programmes with UN Agencies and intergovernmental (such as the World Health Organization) and non-governmental organisations. It has enjoyed consultative status on the United Nations Economic and Social Council since 1995. It was the first Islamic NGO to gain observer status with the International Organisation for Migration (IOM). It is also a member of the International Humanitarian City based in Dubai, UAE.", 'title': 'International Islamic Relief Organization'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Indochina Airlines (Vietnamese: "Hãng Hàng không Đông Dương" ) was a Vietnamese airline based in Ho Chi Minh City. It was the first operational private airline based in Vietnam, originally licensed in May 2008 as Air Speed Up (Vietnamese: "Hãng hàng không Tăng Tốc" ). The founder and chairman of the board was Vietnamese musician Hà Hùng Dũng. Indochina Airlines began selling tickets on 12 November 2008 and launched its first commercial flight from Tân Sơn Nhất International Airport in Ho Chi Minh City to Nội Bài International Airport in Hanoi and Đà Nẵng International Airport in Đà Nẵng on 25 November 2008. After a series of difficulties, including unresolved debts and a drop in customers, Indochina Airlines ceased flying on November 25, 2009; its schedule was revoked two days later.', 'title': 'Indochina Airlines'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Cebu Air, Inc., operating as Cebu Pacific (), is a Philippine low-cost airline based on the grounds of Ninoy Aquino International Airport (NAIA Terminal 3), Pasay City, Metro Manila, in the Philippines. It offers scheduled flights to both domestic and international destinations. Its main base is Ninoy Aquino International Airport, Manila, with other hubs at Mactan-Cebu International Airport, Clark International Airport, Kalibo International Airport Francisco Bangoy International Airport, and Iloilo International Airport.', 'title': 'Cebu Pacific'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Air Vanuatu is an airline with its head office in the Air Vanuatu House, Port Vila, Vanuatu. It is Vanuatu's national flag carrier, operating to Australia, New Zealand and points in the South Pacific. Its main base is Bauerfield International Airport, Port Vila.", 'title': 'Air Vanuatu'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Lenelle Moïse (born 1980) is a poet, actress and playwright born in Port-au-Prince, Haiti. Currently based in the United States, she performs at colleges throughout the country, presenting work about race, gender, class, immigration and sexuality. Her spoken word CD "Madivinez" won the 2007 Patchwork Majority Radio Album Award for Best Solo Album. Moïse was a member of the permanent ensemble cast in the Culture Project\'s premiere production of "Rebel Voices", a play by Rob Urbinati based on Howard Zinn and Anthony Arnove\'s book "Voices of a People\'s History of the United States." In 2008, she developed a two-person vocal musical about art, infamy and race called "EXPATRIATE", also at the Culture Project, in which she co-starred with Karla Cheatham-Mosley. When she was a junior at Ithaca College, Lenelle co-wrote "Sexual Dependency", a feature film by Bolivian filmmaker Rodrigo Bellot who was a schoolmate at the time. The film went on to win the International Film Critics\' Award at the Locarno International Film Festival in Switzerland. Moïse also wrote and starred in Mara Alper\'s short experimental video "To Erzulie" which premiered at the Berlin Sommerfest der Literaturen in July 2002. She has completed her own experimental shorts "Blue Passersby Eyes" and "Atlantic Soul." Her homemade music video "Pied Piper" was an official selection of the International Museum of Women 2007 Online Film Festival. Her essays and poems are published in a number of anthologies, most recently "Word Warriors: 35 Women Leaders of the Spoken Word Revolution" (Seal Press). Her debut book "Haiti Glass" (City Lights Publishers, April 2014), part of the Sister Spit series, is a collection of verse and prose. She experiments with collage as a form of meditative practice and nonlinear storytelling.', 'title': 'Lenelle Moïse'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Líneas Aéreas Azteca ] was an airline based in Mexico City, Mexico. It operated domestic scheduled services and international services to the USA. Its main base was Mexico City International Airport, with a hub at General Abelardo L. Rodríguez International Airport, Tijuana.', 'title': 'Líneas Aéreas Azteca'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Transportes Aeromar, S.A. de C.V, doing business as Aeromar, is an airline based in Hangar 7 of Zone D of the General Aviation Terminal at Mexico City International Airport in Venustiano Carranza, Mexico City, Mexico. Aeromar operates scheduled domestic services in Mexico and international services to the United States. Its main base is Mexico City International Airport.', 'title': 'Aeromar'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Western Airlines (IATA: WA,\xa0ICAO: WAL,\xa0Call sign: Western) was a large airline based in California, with operations throughout the western United States including Alaska and Hawaii, and western Canada, as well as to New York City, Boston, Washington D.C. and Miami on the U.S. east coast and also into Mexico. The airline also served other international destinations such as London, England and Nassau, Bahamas during its existence. Western had hubs at Los Angeles International Airport, Salt Lake City International Airport, and the former Stapleton International Airport in Denver. Before it merged with Delta Air Lines in 1987 it was headquartered at Los Angeles International Airport (LAX). The company\'s slogan for many years was ""Western Airlines...The Only Way To Fly!""', 'title': 'Western Airlines'}]

