 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The Shortcut is a 2009 American horror film directed by Nicholaus Goossen. The film stars Andrew Seeley, Shannon Woodward, Dave Franco and Katrina Bowden. Adam Sandler's production company, Happy Madison Productions (under the name Scary Madison Productions) made it and Sandler served as an executive producer. The film was released direct-to-DVD on September 29, 2009 in the United States.", 'title': 'The Shortcut'}
