 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Sex Drive is a 2008 sex comedy film about a high school graduate who goes on a road trip to have sex with a girl he met online. It is based on the young adult novel "All the Way" by American author Andy Behrens. The film was directed by Sean Anders, and stars Josh Zuckerman, Amanda Crew, Clark Duke, Seth Green, and James Marsden, while Katrina Bowden, Alice Greczyn, Michael Cudlitz, Dave Sheridan, and David Koechner appear in supporting roles. It was released in North America on October 17, 2008, and in the United Kingdom on January 9, 2009.', 'title': 'Sex Drive (film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Hard Sell is an American comedy-drama written and directed by Sean Nalaboff in his directorial debut. The film stars Katrina Bowden, Skyler Gisondo, and Kristin Chenoweth, with Hannah Marks and Kevin Kilner in supporting roles.', 'title': 'Hard Sell (film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Hiatus" is the twenty-first and season finale episode of NBC\'s first season of "30 Rock". It was written by series creator and executive producer Tina Fey, and was directed by Don Scardino. It first aired on April 26, 2007 in the United States. Guest stars in the episode included Katrina Bowden, Kevin Brown, Owen Burke, Grizz Chapman, Matt Dickinson, Rachel Dratch, Brittany Felton, Hannah Flynn, Sean Hayes, Emily Mortimer, Chris Parnell, Portia, Lonny Ross, Justin Smith, Elaine Stritch, Jason Sudeikis and Nikki E. Walker. Lester Holt appeared as himself in this episode.', 'title': 'Hiatus (30 Rock)'}
