 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"The Fighting Irish" is the seventeenth episode of NBC\'s first season of "30 Rock". It was written by one of the season\'s co-executive producers, Jack Burditt and it was directed by Dennie Gordon. It aired on March 8, 2007 in the United States. Guest stars who appeared in this episode were Dan Bakkedahl, Katrina Bowden, Henry Boyle, Anna Chlumsky, Siobhan Fallon Hogan, Chris Hoch, Alice Kremelberg, Nathan Lane, Boris McGiver, John F Mooney, Brian Murray, Maulik Pancholy, Lonny Ross, Molly Shannon, Jason Sudeikis and Kristen Sudeikis.', 'title': 'The Fighting Irish'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Gerry Mays (18 July 1921 – 2006) was a Scottish football player and manager. He played for Hibernian, St Johnstone, Dunfermline Athletic and Kilmarnock, and then managed Ayr United. Mays appeared for Kilmarnock in the 1957 Scottish Cup Final and 1952 Scottish League Cup Final, and for Dunfermline in the 1949–50 Scottish League Cup Final.', 'title': 'Gerry Mays'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Charles "Charlie" Nicholas (born 30 December 1961 in Cowcaddens, Glasgow, Scotland) is a former professional footballer from Scotland who played as a forward. His playing career is best known for his spells at Celtic and Arsenal. He was also capped by Scottish national team, and played for them at the 1986 FIFA World Cup.', 'title': 'Charlie Nicholas'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The 1982 Scottish League Cup Final was played on 4 December 1982, at Hampden Park in Glasgow and was the final of the 37th Scottish League Cup competition. The final was contested by the Old Firm rivals, Celtic and Rangers. Celtic won the match 2–1 thanks to goals by Charlie Nicholas and Murdo MacLeod. Rangers goal was scored by Jim Bett.', 'title': '1982 Scottish League Cup Final'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The 1985 Scottish League Cup Final was played on 27 October 1985, at Hampden Park in Glasgow and was the final of the 40th Scottish League Cup competition. The final was contested by Aberdeen and Hibernian. Aberdeen won the match 3–0 thanks to goals by Eric Black (2) and Billy Stark, giving Alex Ferguson his only Scottish League Cup trophy win.', 'title': '1985 Scottish League Cup Final'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The 2006 Scottish League Cup Final was a football match played on 19 March 2006 at Hampden Park in Glasgow. It was the final match of the 2005–06 Scottish League Cup and the 59th Scottish League Cup Final. The final was contested by Dunfermline Athletic and Celtic. Celtic won the match 3–0, thanks to goals from Maciej Zurawski, Shaun Maloney and Dion Dublin.', 'title': '2006 Scottish League Cup Final'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The 1967 Scottish League Cup Final was played on 28 October 1967 at Hampden Park in Glasgow and was the final of the 22nd Scottish League Cup competition. The final was contested by Dundee and Celtic, with Dundee becoming the first side from outside the Old Firm to reach a League Cup Final since the 1963 Final. Celtic won a high-scoring match by 5–3, with Stevie Chalmers, John Hughes, Bobby Lennox and Willie Wallace all scoring for Celtic. George McLean and Jim McLean scored Dundee's goals.", 'title': '1967 Scottish League Cup Final'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The 2009 Scottish League Cup Final was the final match of the 2008–09 Scottish League Cup, the 62nd season of the Scottish League Cup. The match was played at Hampden Park, Glasgow on 15 March 2009, and was won by Celtic, who beat Old Firm rivals and Cup holders, Rangers, 2-0 after extra time.', 'title': '2009 Scottish League Cup Final'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The 1955 Scottish League Cup Final was played on 22 October 1955, at Hampden Park in Glasgow and was the final of the 10th Scottish League Cup competition. The final was contested by Aberdeen and St Mirren. Aberdeen won the match 2–1, thanks to a goal by Graham Leggat and an own goal by Jim Mallan. The winning goal, scored 11 minutes from the end, was a "wind-assisted cross". Aberdeen manager Davie Shaw later admitted that they had been "damn lucky" to win the Cup. The match proved to be St Mirren\'s last appearance in a Scottish League Cup Final until 2010.', 'title': '1955 Scottish League Cup Final'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 2008 Scottish League Cup Final was played on 16 March 2008 at Hampden Park in Glasgow and was the 61st Scottish League Cup Final. The final was contested by Dundee United, who beat Aberdeen 4–1 in the semi-final, and Rangers, who beat Hearts 2–0. The two sides had last met in a League Cup Final in the 1984–85 season with Rangers winning 1–0 on that occasion. The previous year's winners were Hibernian, who beat Kilmarnock 5–1 in the 2007 Final but they were knocked out in the third round by Motherwell who beat them 4–2, it was the fifth successive year in which both of the previous year's finalists did not make it to the final. Rangers won the match 3–2 on penalties after the match had ended in a 2–2 draw after extra time.", 'title': '2008 Scottish League Cup Final'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The 2011 Scottish League Cup Final was the final match of the 2010–11 Scottish League Cup, the 64th season of the Scottish League Cup. It was played by Old Firm rivals Celtic and Rangers. Rangers won the trophy after extra time 2–1.', 'title': '2011 Scottish League Cup Final'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': '"My Eyes" is a song recorded by American country music artist Blake Shelton featuring Gwen Sebastian. It was released in April 2014 as the fifth single from his seventh studio album, "Based on a True Story...". The song was written by Andrew Dorff, Tommy Lee James and Josh Osborne.', 'title': 'My Eyes (Blake Shelton song)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Based on a True Story… is the eighth studio album by American country music artist Blake Shelton. It was released on March 26, 2013 via Warner Bros. Records and debuted at #3 with a career best for Shelton at nearly 200,000 sold. The album became the ninth best-selling album of 2013 in the US, earning Shelton a Platinum certification by the RIAA on September 30, 2013. In 2016, "Based on a True Story…" was certified double-platinum by the RIAA.', 'title': 'Based on a True Story...'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Christy Sutherland (born April 9, 1976) is a Nashville country music and praise/worship singer-songwriter. Signed to Epic Records in 2004, she charted the single "Freedom" on the Hot Country Songs charts. She is married to Kenneth Matthew Dudney, son of Country music star, Barbara Mandrell. The two were wed on July 14, 2006 during a private ceremony at Mandrell\'s private home. Dudney currently works as tour and business manager for Sutherland.', 'title': 'Christy Sutherland'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Keyed Up is the fifteenth studio album by country music star Ronnie Milsap, released in 1983. It featured the No.\xa05 country chart hit "Stranger in My House", plus the No.\xa01 country hits "Don\'t You Know How Much I Love You" and "Show Her."', 'title': 'Keyed Up'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'This Is Me is the ninth studio album by country music star Randy Travis, and was released on April 26, 1994 by Warner Bros.. Producer Kyle Lehning, Travis, and A&R Martha Sharp considered more than 1,000 songs before settling on the final ten. The tracks "Before You Kill Us All", "Whisper My Name", "This Is Me", and "The Box" were all released as singles, peaking at #2, #1, #5, and #8, respectively, on the "Billboard" country music charts. "Small Y\'all" was later recorded by George Jones on his 1998 album "It Don\'t Get Any Better Than This".', 'title': 'This Is Me (Randy Travis album)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Country Music Star No. 1 contains recordings of a prestardom Glen Campbell, which were made around 1960–1961. This album, just like the other Starday album Country Soul, was released after Campbell rose to international fame with hits including "Gentle on My Mind", "By the Time I Get to Phoenix" and "Wichita Lineman". Campbell sued against these releases but eventually settled with Starday.', 'title': 'Country Music Star No. 1'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Old 8×10 is the third studio album by country music star Randy Travis. It was released on July 12, 1988 by Warner Bros. Records Nashville. The album produced the singles "Honky Tonk Moon", "Deeper Than the Holler", "Is It Still Over", and "Promises". All of these except "Promises" reached Number One on the Hot Country Songs charts in the late 1980s. The German edition of the album (the first Randy Travis release in that country) contained the bonus track "Forever and Ever, Amen". In January 1990, Old 8×10 earned Travis three American Music Awards for \'Favorite Country Male Artist\', \'Favorite Country Album\', and \'Favorite Country Single\' (Deeper Than the Holler).', 'title': 'Old 8×10'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Gruhn Guitars is a musical instrument shop and place of interest located in Nashville, Tennessee. Vintage instruments comprise a large portion of its inventory, but it also features new instruments from factories and independent luthiers. It is a mecca for rock stars and well-heeled collectors. The business opened on January 2, 1970. It won a lot of new business and national attention after Visa featured it in 1992 in a TV commercial. George Gruhn is the world’s leading expert on vintage American guitars and related instruments, according to Walter Carter, historian and archivist for the Gibson Guitar Company. The shop was originally called GTR, which stood for George Gruhn, Tut Taylor and Randy Wood; a story has circulated that country music star Hank Williams, Jr. encouraged Gruhn to go into business. The store is located right by the stage door of the Ryman Auditorium, the home of the Grand Ole Opry. On December 31, 2006, Garrison Keillor, for his New Year\'s Show at Ryman Auditorium for PBS\' "Great Performances" visited Gruhn Guitars with Vince Gill before the start of the show. Garrison Keiller\'s New Year\'s Eve Special Gill told a story about buying some of his guitars at Gruhn\'s. "Gruhn\'s customer\'s have included the likes of Duane Allman, Mark Knopfler, Conan O\'Brien, Robert Plant and Eric Clapton.', 'title': 'Gruhn Guitars'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Stranger in the House" is a song composed by Elvis Costello. Costello recorded the song as a duet with country music star George Jones in the summer of 1978 for Jones\' 1979 album "My Very Special Guests". Costello also recorded a solo version recorded at a John Peel session on October 1978 which surfaced as a free 7" single with the first copies of his second album "This Year\'s Model" in the United Kingdom. According to Holly Jones-Warren\'s liner notes to the 2005 Legacy Records reissue of "My Very Special Guests", Costello wrote the song specifically with Jones in mind, with the new wave star stating, "George Jones was my guiding light whenever I wrote in the country idiom."', 'title': 'Stranger in the House (song)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Randy Bruce Traywick (born May 4, 1959), better known by his stage name, Randy Travis, is an American country music singer, songwriter, guitarist, and actor. Since 1985, he has recorded 20 studio albums and charted more than 50 singles on the "Billboard" Hot Country Songs charts, and 16 of these were number-one hits. Considered a pivotal figure in the history of country music, Travis broke through in the mid-1980s with the release of his album "Storms of Life", which sold more than four million copies. The album established him as a major force in the Neotraditional country movement. Travis followed up his successful debut with a string of platinum and multi-platinum albums. He is known for his distinctive baritone vocals, delivered in a traditional style that has made him a country music star since the 1980s.', 'title': 'Randy Travis'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Beer stein ( ), or simply stein, is an English neologism for either traditional beer mugs made out of stoneware, or specifically ornamental beer mugs that are usually sold as souvenirs or collectibles. In German, the word "stein " means stone and is not used to refer to a beverage container.', 'title': 'Beer stein'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Sitting Bull Trophy is the name of the rivalry trophy that was awarded to the winner of the annual football game between the University of North Dakota Fighting Hawks (formerly the North Dakota Fighting Sioux) and the University of South Dakota Coyotes. The rivalry stems from the time the two teams spent competing together in the North Central Conference (1922–2007) and later in the Great West Conference (2008–2011).', 'title': 'Sitting Bull Trophy'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'There are three Red River Rivalry trophies given to the winner of the annual Red River Rivalry (previously Red River Shootout) which is a college football rivalry game between The University of Texas Longhorns and the University of Oklahoma Sooners. The trophies are the Golden Hat, the Red River Rivalry trophy and the Governors\' trophy. The trophies reward the annual winner of one of college football\'s longest and most intense rivalries. 2005 marked the 100th meeting of the two football programs. The rivalry began in 1900 while Oklahoma was still a territory of the United States. In the first 100 games of the rivalry, Texas won 56 times to 39 Oklahoma victories and 5 ties. The 2007 match-up between Oklahoma and Texas was predicted to be the #3 game to watch in 2007 by SI.com\'s "Top 20 Games To Watch In 2007" list.', 'title': 'Red River Rivalry trophies'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The River City Rivalry was an annual game played between former Big East rivals University of Pittsburgh and University of Cincinnati. The rivalry itself was relatively brief, played annually from 2005, during which season the rivalry trophy was introduced. Before the rivalry was titled, the two teams played each other in 1921, 1922, 1979, and 1981. The rivalry went on hiatus, like many others throughout the country, in the aftermath of the 2010–13 NCAA conference realignment, which left the programs in separate leagues. However, the two teams are scheduled to meet in a home-and-home series for the 2023 and 2024 seasons.', 'title': 'River City Rivalry'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The Little Brown Stein is a rivalry trophy awarded to the winner of the college football game between the University of Idaho Vandals and University of Montana Grizzlies. The trophy is, as the name implies, a large stein mug with the results of all the games between the two painted on.', 'title': 'Little Brown Stein'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Francis Marion "Cotton" Davidson (born November 30, 1931) is a former American football quarterback. Davidson attended Baylor University, and played professionally for the National Football League\'s Baltimore Colts (1954, 1957), and the American Football League\'s Dallas Texans (1960–1962) and Oakland Raiders (1962–1968). Davidson also played quarterback for the Fort Bliss Falcons in 1955 to 1957. A game between the Fort Bliss Falcons and the Fort Sill, Oklahoma Cannoneers was played for a trophy called "The Little Brown Dud." The Cannoneers won the game and took home the Little Brown Dud. Cotton was awarded ALL ARMY QUARTERBACK in 1955.', 'title': 'Cotton Davidson'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Hoosier Helmet Trophy is the name of the rivalry trophy between the Butler Bulldogs and the Valparaiso Crusaders. Both schools are members of the Pioneer Football League. Butler and Valparaiso first played in 1927, and have played each other in football every year since 1951. The two teams have met 75 times on the football field, with Butler currently holding a 50–25 edge in the all time series. In 2006, at the suggestion of Butler head coach Jeff Voris, the Hoosier Helmet Trophy was created to commemorate and intensify the long-standing rivalry between the two schools.', 'title': 'Hoosier Helmet Trophy'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Michigan–Minnesota football rivalry is an American college football rivalry between the Michigan Wolverines football team of the University of Michigan and Minnesota Golden Gophers football team of the University of Minnesota. The Little Brown Jug is an earthenware jug that serves as a trophy awarded to the winner of the game. It is one of the oldest and most played rivalries in American college football, dating to 1892. The Little Brown Jug is the most regularly exchanged rivalry trophy in college football, the oldest trophy game in FBS college football, and the second oldest rivalry trophy overall, next to the 1899 Territorial Cup (which did not become a travelling/exchange trophy until 2001), contested between Arizona and Arizona State (which did not become a four-year college until 1925).', 'title': 'Little Brown Jug (college football trophy)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Arizona–Arizona State football rivalry, sometimes known as the Duel in the Desert, is a college football rivalry between the University of Arizona Wildcats and the Arizona State University Sun Devils. One of the longest football rivalries, the winner receives the Territorial Cup, created for the 1899 champion between schools in Arizona and which the NCAA has certified as the oldest rivalry trophy in college football. While the Territorial Cup did not change hands as a regular part of the competition until 2001, the rivalry between the two schools continued after 1899, a semi-regular event until becoming an annual event from 1946 onwards. It is part of the wider Arizona–Arizona State rivalry, which crosses 20 varsity intercollegiate sports.', 'title': 'Arizona–Arizona State football rivalry'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The Sabine Shoe is the name of the bronze shoe trophy that was awarded to the winner of the annual football game between the Louisiana–Lafayette Ragin' Cajuns (formerly the Southwestern Louisiana Bulldogs) and the Lamar Cardinals. The first Sabine Shoe trophy was awarded in 1937 to the winner of the SLI–Lamar football game. The name of the bronze rivalry trophy was derived from the Sabine River that forms part of the Texas–Louisiana border. USL defeated Lamar in the 1978 edition of the rivalry game, but the Ragin' Cajuns were not awarded the trophy as it had vanished. The Sabine Shoe trophy now sits in at trophy case in the Ragin' Cajun Athletic Complex in Lafayette, Louisiana. The two teams have met 34 times on the football field, with the Ragin' Cajuns currently holding a 23–11 edge in the all time series. The game has been infrequently played following the Ragin' Cajuns departure from the Southland Conference in football. Following the 1981 season, the conference was one of several forced to reclassify from NCAA's Division I-A to Division I-AA. The Ragin' Cajuns, a member of Division I-A since 1978, met the NCAA requirements to remain a Division I-A member and chose to continue participation in that sub-division.", 'title': 'Sabine Shoe'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Douglas River, formerly known as the Twain, is a river of the West Coast of New Zealand's South Island. Its source is high in the Southern Alps, five kilometres south of Mount Sefton, and its upper reaches are fed by water from the Douglas Glacier. It flows west for 18 kilometres, joined by runoff from the Horace Walker Glacier, before joining the waters of the Karangarua River. The Douglas River's entire course is within Westland Tai Poutini National Park. The river and glacier are named after Charles Edward Douglas, a 19th-century explorer and mountaineer.", 'title': 'Douglas River'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Rising Sun Auto Camp, also known as the Roes Creek Auto Camp, East Glacier Auto Camp or simply Rising Sun preserves a portion of the built-up area of Glacier National Park that documents the second phase of tourist development in the park. Rising Sun is located along the Going-to-the-Sun Road, approximately 7 mi from the east entrance to Glacier National Park, Montana, United States. Rising Sun is a wayside area that has a National Park Service campground, a camp store and gift shop, picnic area, restaurant, as well as a motel and guest cabins which are managed by the park\'s concessionaire, Xanterra Parks & Resorts. In the immediate area, there is also a boat dock as well as sightseeing boats which allow visitors to tour Saint Mary Lake, the second largest lake in the park. "The most popular spot for [Glacier] tourists is Rising Sun, an overlook of Goose Island in St. Mary Lake and one of the most photographed spots in the park."', 'title': 'Rising Sun Auto Camp'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Sea Pines Resort or Sea Pines is located in Sea Pines Plantation, a 5,200-acre private residential gated community located on the southern tip of the island which comprises the town of Hilton Head Island, South Carolina. Sea Pines is home to four golf courses, including Harbour Town Golf Links, Atlantic Dunes by Davis Love III, (formerly known as the Ocean Course), the Heron Point golf course (formerly known as the Sea Marsh course) and the Sea Pines Country Club Course. The RBC Heritage is a PGA Tour event held annually in April at the Harbour Town course.', 'title': 'Sea Pines Resort'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Tierra del Fuego—literally "Land of the Fire", formerly "Isla de Xativa" and also known as Isla Grande de Tierra del Fuego—is an island near the southern tip of South America from which it is separated by the Strait of Magellan. The western portion (61.43%) of the island (29,484.7 km2 ) is in Chile (Province of Tierra del Fuego and Antártica Chilena Province), while the eastern portion (38.57%, 18,507.3 km2 ) is in Argentina (Tierra del Fuego Province). It forms the major landmass in an extended group of islands or archipelago also known as Tierra del Fuego.', 'title': 'Isla Grande de Tierra del Fuego'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Wanshan Archipelago Campaign (万山群岛战役) was a campaign fought between the communist and the nationalist forces during the Chinese Civil War for the control of Wanshan Archipelago ("Wanshan Qundao", 万山群岛), and resulted in communist victory. The archipelago consists of 48 islands strategically located at the mouth of the Pearl River, a chokepoint on the communication lines to Hong Kong and Macau. The largest island is the Laurel Mountain (Guishan, 桂山) Island, which was formerly known as Trash Tail (Lajiwei, 垃圾尾) Island. Other major islands include Outer Linding (Wailinding, 外伶仃) Island, Dong\'ao (东澳) Island, Tri-gate (Sanmen, 三门) Island, Greater Ten-thousand Mountain (Da Wanshan, 大万山) Island, Lesser Ten-thousand Mountain (Xiao Wanshan, 小万山) Island, Burden Pole (Dangan, 担杆) Islands, and Jianpeng (佳蓬) Islands.', 'title': 'Wanshan Archipelago Campaign'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Sherburne Ranger Station in Glacier National Park is an example of the National Park Service Rustic style. Located in the Swiftcurrent portion of the park, it was built in 1926. It is part of a small historic district that includes a mess hall and subsidiary structures, formerly known as the Sherburne Road Camp, established in 1931. The ranger station closely resembles the ranger stations at Belly River and Lake McDonald. A checking station at the road remains substantially intact.', 'title': 'Sherburne Ranger Station Historic District'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Marinelli Glacier is a tidewater glacier located in Alberto de Agostini National Park, Isla Grande de Tierra del Fuego. The glacier spills out from the backbone of the Cordillera Darwin and calves into Ainsworth Bay, an embayment of the Almirantazgo Fjord. The Marinelli Glacier is in a state of retreat, beginning at least as early as 1960 and continuing to the present time.', 'title': 'Marinelli Glacier'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Boaz Island, formerly known as "Gate\'s Island" or "Yates Island", is one of the six main islands of Bermuda. It is part of a chain of islands in the west of the country that make up Sandys Parish, lying between the larger Ireland Island and Somerset Island, and is connected to both by bridges. Its east coast forms part of the edge of the Great Sound. Boaz Island was part of the Royal Naval base, which included the HM Dockyard on Ireland Island. From 1939, Boaz Island was used as a Royal Naval Air Station. Its primary role was the servicing, repair and replacement of spotter floatplanes and flying boats belonging to naval vessels. Early in the Second World War, with no other units to fill the role, aeroplanes from Boaz Island were used to maintain anti-submarine air patrols, using whatever aircrew were on hand, including pilots from the Bermuda Flying School on Darrell\'s Island. All that remains of the Fleet Air Arm facility today is a hangar on runway road, and two slips.', 'title': 'Boaz Island, Bermuda'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Lian Island () is the largest island in Lianyungang, Jiangsu, China. The island is located inside Haizhou Bay in the Yellow Sea. It is 9 km long from east to west across the island and it has an area of 7.57 km2 . 80% of the island is covered with forests. The longest sea dyke nationally (6.7 km long) connects the island with the east of the city of Lianyungang. Lian Island is the only AAAA-class seashore tourist attraction in Jiangsu. The island was formerly known as Yingyou hill.', 'title': 'Lian Island'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Birnie Island is a small, uninhabited coral island, 20 hectares in area, part of the Phoenix Island group, that is part of the Republic of Kiribati. It is located about 100\xa0km SE of Kanton Island and 90\xa0km WNW of Rawaki Island, formerly known as Phoenix Island. It lies at . Birnie island measures only 1.2\xa0km long and 0.5\xa0km wide. There is no anchorage, but landing can be made on the lee beach.', 'title': 'Birnie Island'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Duff Clark "Duffy" Jackson (born July 3, 1953, Freeport, New York) is an American jazz drummer.', 'title': 'Duffy Jackson'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Joseph Mark "Joe" Cohn (born December 28, 1956, Flushing, New York) is an American jazz guitarist. His father is Al Cohn. Joe\'s daughter Shaye Cohn, is a musician who plays cornet with her band Tuba Skinny in New Orleans and at jazz festivals in Italy and Australia and elsewhere. Shaye also plays accordion, violin and piano. Joe studied at Berklee College of Music, and has played with Bob Mover, Nick Brignola, Freddy Cole, Buddy DeFranco, Dick Johnson, Al Grey, Carmen Leggio, and Duffy Jackson.', 'title': 'Joe Cohn'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Rob Jackson born 4 September 1981 in Salford, Greater Manchester, England is a rugby league player for Whitehaven in National League One.', 'title': 'Rob Jackson'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Richard Michael Duffy (born 30 August 1985) is a Welsh professional footballer who plays for EFL League Two club Notts County. A versatile player who can play either on the right or at the centre of defence, he won 13 caps for Wales between 2005 and 2008. He is the younger brother of Robert Duffy.', 'title': 'Richard Duffy'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Rt. Hon. Sir Charles Gavan Duffy, , PC (12 April 1816 – 9 February 1903), Irish-Australian nationalist, journalist, poet and politician, was the 8th Premier of Victoria and one of the most colourful figures in Victorian political history. Duffy was born in Dublin Street, Monaghan Town, County Monaghan, Ireland, the son of a Catholic shopkeeper. Both his parents died while he was still a child and his uncle, Fr James Duffy, who was the Catholic parish priest of Castleblayney, became his guardian for a number of years.', 'title': 'Charles Gavan Duffy'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Walter A. Duffy was a member of the Wisconsin State Assembly. Duffy was first elected to the Assembly in 1914, succeeding Hubert H. Peavey, a future member of the United States House of Representatives. He was re-elected in 1916. Additionally, Duffy was a member of the Bayfield County, Wisconsin Board of Supervisors. He was a Republican. Duffy was born in Washburn, Wisconsin in 1889.', 'title': 'Walter A. Duffy'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Michael A. Jackson (born March 29, 1964) is the current Maryland state delegate for District 27B in Prince George's County and is on three committees. Jackson is also the former Sheriff of Prince George's County, Maryland. Pursuant to Maryland Common Law, Jackson's position as the elected sheriff made him the senior law enforcement official of his jurisdiction and his authority superseded all others within the county. Jackson, a Democrat, served for two terms, from 2002 to 2010. The area that he served contains an estimated 820,852 residents, holds the Washington Redskins Stadium (Fedex Field, the largest stadium in the NFL), the University of Maryland, College Park, and the National Harbor. Although violent crimes had dropped since 2006, in 2007, Prince George's County reported over 130 homicides, the highest rate of any county in Maryland.", 'title': 'Michael A. Jackson (politician)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Keith Duffy is an Irish bass guitarist, best known for his long-standing support role in the folk-pop band The Corrs. He was born Keith Arnold Jacques Duffy on 2 June 1966, in Drogheda, County Louth, Ireland.', 'title': 'Keith Duffy (bassist)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Patrick J. Duffy (28 July 1875 – 21 July 1946) was an Irish Cumann na nGaedheal politician. He was first elected to Dáil Éireann as a Cumann na nGaedheal Teachta Dála (TD) for the Monaghan constituency at the 1923 general election. He lost his seat at the June 1927 general election. Patrick J. Duffy was born in Doohamlet, near Castleblayney in County Monaghan. He was an active member of the Irish Volunteers and took part in the Irish War of Independence. He was married to Sarah Lawless of Ringsend, Dublin and had 8 children with her.', 'title': 'Patrick Duffy (Irish politician)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Freeport (officially The Incorporated Village of Freeport) is a village in the town of Hempstead, Nassau County, New York, USA, on the South Shore of Long Island. The population was 43,713 at the 2010 census. A settlement since the 1640s, it was once an oystering community and later a resort popular with the New York City theater community. It is now primarily a bedroom suburb but retains a modest commercial waterfront and some light industry.', 'title': 'Freeport, New York'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Enabling Act (German: "Ermächtigungsgesetz ") was a 1933 Weimar Constitution amendment that gave the German Cabinet – in effect, Chancellor Adolf Hitler – the power to enact laws without the involvement of the Reichstag. It passed in both the Reichstag and Reichsrat on 24 March 1933, and was signed by President Paul von Hindenburg later that day. The act stated that it was to last four years unless renewed by the Reichstag, which occurred twice. The Enabling Act gave Hitler plenary powers. It followed on the heels of the Reichstag Fire Decree, which abolished most civil liberties and transferred state powers to the Reich government. The combined effect of the two laws was to transform Hitler\'s government into a legal dictatorship.', 'title': 'Enabling Act of 1933'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Tornow had the task of taking care of Hitler's beloved German shepherd Blondi, as well as her puppies, and Eva Braun's dogs. Additionally, Tornow had his own pet dachshund.", 'title': 'Fritz Tornow'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Martin Adolf Bormann ((1930--)14 1930 in Grünwald – in Herdecke) was a German theologian laicized Roman Catholic priest, the eldest of the ten children of Martin Bormann and a godson of Adolf Hitler.', 'title': 'Martin Adolf Bormann'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Martin Bormann (17 June 1900\xa0– 2 May 1945) was a prominent official in Nazi Germany as head of the Nazi Party Chancellery. He gained immense power within the Third Reich by using his position as Adolf Hitler's private secretary to control the flow of information and access to Hitler.", 'title': 'Martin Bormann'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Adolf Hitler\'s religious beliefs have been a matter of debate; the wide consensus of historians consider him to have been irreligious and anti-Christian. In light of evidence such as his vocal rejection of the tenets of Christianity as a teenager, numerous private statements to confidants denouncing Christianity as a harmful superstition, and his strenuous efforts to reduce the influence and independence of Christianity in Germany after he came to power, Hitler\'s major academic biographers conclude that he was irreligious and an opponent of Christianity. Historian Laurence Rees found no evidence that "Hitler, in his personal life, ever expressed belief in the basic tenets of the Christian church". Hitler\'s remarks to confidants, as described in the Goebbels Diaries, the memoirs of Albert Speer, and transcripts of Hitler\'s private conversations recorded by Martin Bormann in "Hitler\'s Table Talk", are further evidence of his irreligious and anti-Christian beliefs; these sources record a number of private remarks in which Hitler ridicules Christian doctrine as absurd, contrary to scientific advancement, and socially destructive.', 'title': 'Religious views of Adolf Hitler'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Vorbunker (upper bunker or forward bunker) was an underground concrete structure originally intended to be a temporary air-raid shelter for Adolf Hitler and his guards and servants. It was located behind the large reception hall that was added onto the old Reich Chancellery, in Berlin, Germany, in 1936. The bunker was officially called the "Reich Chancellery Air-Raid Shelter" until 1943, when the complex was expanded with the addition of the "Führerbunker", located one level below. On 16 January 1945, Hitler moved into the "Führerbunker". He was joined by his senior staff, including Martin Bormann. Later, Eva Braun and Joseph Goebbels moved into the "Führerbunker" while Magda Goebbels and their six children took residence in the upper "Vorbunker". The Goebbels family lived in the "Vorbunker" until their deaths on 1 May 1945.', 'title': 'Vorbunker'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Albert Bormann (2 September 19028 April 1989) was a German National Socialist Motor Corps (NSKK) officer, who rose to the rank of "Gruppenführer" ("Generalleutnant") during World War II. Bormann served as an adjutant to Adolf Hitler, and was the younger brother of Martin Bormann.', 'title': 'Albert Bormann'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'During the final weeks of the Third Reich and the war in Europe, many civilians, government officials and military personnel throughout Nazi Germany committed suicide. Aside from high-ranking Nazi officials like Adolf Hitler, Joseph Goebbels, Heinrich Himmler, Philipp Bouhler and Martin Bormann, many others chose "\u200aSelbstmord" (German: "Self-murder" ) rather than accept the defeat of Germany. Studies have shown that the suicides were influenced through Nazi propaganda (reaction to the suicide of Adolf Hitler), the tenets of the Nazi Party, and the anticipated reprisals following the Allied occupation of Nazi Germany. For example in April 1945, at least 1,000 people killed themselves and others within 72 hours as the Red Army neared the East German town of Demmin.', 'title': 'Mass suicides in 1945 Nazi Germany'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Blondi (1941 – 29 April 1945) was Adolf Hitler\'s German Shepherd, a gift as a puppy from Martin Bormann in 1941. Blondi stayed with Hitler even after his move into the "Führerbunker" located underneath the garden of the Reich Chancellery on 16 January 1945.', 'title': 'Blondi'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Hitler\'s Table Talk" (German: "Tischgespräche im Führerhauptquartier") is the title given to a series of World War II monologues delivered by Adolf Hitler, which were transcribed from 1941 to 1944. Hitler\'s remarks were recorded by Heinrich Heim, Henry Picker, and Martin Bormann, and later published by different editors, under different titles, in three different languages.', 'title': "Hitler's Table Talk"}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Gibraltar Point national nature reserve is an area of approximately 4.3 km2 in Lincolnshire, England.', 'title': 'Gibraltar Point'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Danes Moss Nature Reserve is a 13.4 ha nature reserve south of Macclesfield, Cheshire, England. A Site of Special Scientific Interest, it is managed by the Cheshire Wildlife Trust.', 'title': 'Danes Moss Nature Reserve'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Woodford Halse Nature Reserve is a 5.7 hectare nature reserve south of Woodford Halse in Northamptonshire. It is managed by the Wildlife Trust for Bedfordshire, Cambridgeshire and Northamptonshire.', 'title': 'Woodford Halse Nature Reserve'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Seacroft is a linear settlement in the East Lindsey district of Lincolnshire, England. It lies at the south of, and is conjoined to, Skegness , and comprises the less than half-mile long residential road, Seacroft Esplanade, and a golf course at its south. Farther south is Gibraltar Point nature reserve.', 'title': 'Seacroft, Lincolnshire'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Baikal Nature Reserve ( ; Russian: Байка́льский запове́дник , "Baikalski Zapovednik") is a nature reserve on the southeast shore of Lake Baikal, in southern Buryatia, Russia. Also called Baikal Zapovednik, it was established in 1969 for preserving the nature along the lake and the neighboring central part of the Chamar-Daban Range. The area of this nature reserve is 165,700 ha . It hosts dark pine taiga (silver fir, cedar, spruce), thin forests, Siberian Dwarf Pine and rhododendron underbrush, subalpine meadows, and alpine tundras. The Baikal Nature Reserve is home to 812 kinds of plants, 49 types of mammals, 272 birds, 3 reptiles, 3 amphibians, and 7 types of fish. The reserve is also home to East Siberian brown bear, Baikal lynx, wolverine, otter, osprey, and golden eagle. The Baikal Nature Reserve is part of the World Network of Biosphere Reserves (also see "List of biosphere reserves in the Russian Federation"). The reserve is also a part of the Lake Baikal World Heritage Site. The Kabansky Nature Zakaznik, across , was transferred under the jurisdiction of the Baikal Nature Reserve in 1985.', 'title': 'Baikal Nature Reserve'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Kiehnmoor is a nature reserve in Germany. It was designated as a nature reserve in 1992. It has an area of 440 ha of which 100 ha lie in Celle district and 340 ha in Uelzen district. The nature conservation authorities of these districts are responsible for the reserve. A large part of the area is wet meadow, that in places is intensively farmed. However the majority of the area has been left in its natural state. A small sand heath forms part of the reserve. Its southern perimeter borders immediately on the larger heathland area of the Südheide Nature Park. The "Heidschnucken", moorland sheep characteristic of the region, are reared here. North of the Kiehnmoor and immediately adjacent to it is the valley of a partially dammed stream, the "Gerdau", and the Brambosteler Moor nature reserve. To the southeast the reserve borders on the Unterlüß Firing Range ("Schießplatz Unterlüß"), belonging to the firm of Rheinmetall, and the "Große Heide" ("Large Heath") near Unterlüß, that is closed to the public. Kiehnmoor, too, is totally out-of-bounds. This whole area is very secluded. Rare birds have settled here including the crane and the black stork. Even the otter may be found here.', 'title': 'Kiehnmoor'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Mogumber Nature Reserve is a nature reserve in Western Australia. It is a refuge for the endangered Western Swamp Tortoise along with the Twin Swamps Nature Reserve and the Ellen Brook Nature Reserve. Twin Swamps and Ellen Brook are IUCN Protected Area Management Category IV Reserves, while the Mogumber Nature Reserve is a Category Ia nature reserve.', 'title': 'Mogumber Nature Reserve'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Darland's Lake Nature Reserve is a nature reserve south of Totteridge Village in Barnet, England. It is owned by the London Borough of Barnet and was managed from 1971 by the Hertfordshire and Middlesex Wildlife Trust, and more recently by the borough council. In 2007 the council spent £215,000 on repairing the dam and other works, and then proposed leasing the reserve to the Wildlife Trust. However, the transfer did not take place and the nature reserve is currently not managed.", 'title': "Darland's Lake Nature Reserve"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Gibraltar Nature Reserve (formerly the Upper Rock Nature Reserve) is a protected nature reserve in the British Overseas Territory of Gibraltar that covers over 40% of the country's land area. It was established as the Upper Rock Nature Reserve in 1993 under the International Union for Conservation of Nature's category Ia (strict nature reserve) and was last extended in 2013. It is known for its semi-wild population of Barbary macaques, and is an important resting point for migrating birds.", 'title': 'Gibraltar Nature Reserve'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Pù Luông Nature Reserve is a nature reserve in northern Vietnam. This nature reserve is situated in Quan Hóa and Bá Thước districts of Thanh Hóa Province, North Central Coast region of Vietnam. Pu Luong Nature Reserve is bordered by Mai Châu, Tân Lạc and Lạc Sơn districts of Hòa Bình Province. The reserve is located along two parallel mountain ridges, that run from north-west to south-east, and are divided by a central valley, which contains several human settlements and a large agricultural land area, therefore, is not included within the nature reserve. Pù Luông is endowed with great biodiversity, its flora and fauna is closely associated with the Cúc Phương National Park 25\xa0km south-east.', 'title': 'Pù Luông Nature Reserve'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Wipeout is a game show series in which contestants competed in what was billed as the "World\'s Largest" obstacle course. "Wipeout" was hosted and commentated by John Henson and John Anderson, while Jill Wagner acted as the "on-location" presenter. The show aired on ABC from June 24, 2008 until the show aired its final episode on September 7, 2014. The interim presenter for one season was Vanessa Lachey. The creators and executive producers are Matt Kunitz and Scott Larsen. Distribution of the show was handled by Endemol USA. The show was taped at Sable Ranch in Canyon Country, Santa Clarita, California, about 40 miles north of Los Angeles.', 'title': 'Wipeout (2008 U.S. game show)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "TREC, short for the French Techniques de Randonnée Équestre de Compétition is an equestrian discipline designed to test horse and rider. With origins in France, the sport has spread through Europe, and was introduced to the UK by the British Horse Society (BHS) in 1998. The sport is now known as British TREC and is run by TREC GB. TREC competitions consist of three separate events (phases) - mounted orienteering, a demonstration of control of the horse's paces and an obstacle course - all completed over the course of one or two days, and points scored, with the highest scoring being declared the overall event winner.", 'title': 'Techniques de Randonnée Équestre de Compétition'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Run For Your Lives (RFYL) is a 3-5K obstacle course adventure run series created by Maryland-based Reed Street Productions (RSP). Like other obstacle races, runners navigate through various terrain and physically challenging obstacles. Unlike other obstacle races, runners try to dodge and escape from zombies roaming the course trying to grab flags from runners' flagbelts, similar to flag football. The course was designed to incorporate zombies as well as SERE training learned by a RSP managing-member who is active-duty navy. The inaugural race had about 12,000 attendees and was covered by multiple news sources.", 'title': 'Run for Your Lives (obstacle racing)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Obstacle course racing (OCR) is a sport in which a competitor, traveling on foot, must overcome various physical challenges that are in the form of obstacles. Mud and trail runs are combined and the races are designed to result in mental and physical collapse. Obstacles include, but are not limited to, climbing over walls, carrying heavy objects, traversing bodies of water, crawling under barbed wire, and jumping through fire. Many obstacles are similar to those used in military training, while others are unique to obstacle racing and are employed throughout the course to test endurance, strength, speed and, dexterity. Races vary in both distance and challenge level, combining trail running, road running, and cross country running. With race venues typically in large cities, organizers encourage athletes of all types to participate. All Obstacles were introduced into Cross Country Running at Tough Guy, recorded on video 1989 - 2007. Most signature obstacles were actually created by Mr Mouse. According to the "Los Angeles Times" in 2012, the number of events—typically all-day festivals—rose rapidly. In accordance with the sub-culture\'s fast rate of growth, the "Obstacle Race Magazine" was launched.', 'title': 'Obstacle racing'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'All American Girl is a 2003 reality competition that started with 45 females vying for the title of the same name. In the first episode the field of 45 is cut down to 15 by means of a talent show competition and obstacle course. At the talent show and obstacle course, three coaches (Geri Halliwell, John Salley, Suzanne de Passe) decided who the 15 finalists would be. After the 15 finalists were decided, the coaches picked five girls to be on their team for the whole series. During the series, the three teams went through a training camp to train them in a vast array of disciplines that included athletic ability, mental agility, performance in the popular arts and beauty. Each week some of the contestants were cut from the competition until there were only six contestants, followed by another cut down to a final three. The winner was decided by viewer phone voting. The show was hosted by Mitch Mullany.', 'title': 'All American Girl (2003 TV series)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Kunoichi (クノイチ; stylized as KUNOICHI in Japan) is a women\'s obstacle course competition held in Japan and broadcast on the Tokyo Broadcasting System. It is a spin-off of "Sasuke", another obstacle course series. "Kunoichi" is different from "Sasuke" in that the competitors are exclusively female. It is also broadcast as Women of Ninja Warrior on the American G4 channel. KUNOICHI has been renewed for a 9th tournament after an 8-year hiatus for 2017. It was taped on January 26, 2017, took place at the Makuhari Messe Convention Hall, unlike past tournaments taking place at Midoriyama Studio City.', 'title': 'Kunoichi (TV series)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'A*mazing was an Australian children\'s television game show that aired between 16 May 1994 until 1998 on the Seven Network. It was famous for a relatively large and elaborate maze/obstacle course that was part of the show\'s studio set. "A*mazing" was hosted by James Sherry for the entire run of the series. A*mazing was produced at Channel 7 Brisbane from 1994–1996 and then at Channel 7 Perth from 1997–1998.', 'title': 'A*mazing'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Colin Bryce (born Newcastle upon Tyne, 4 August 1974) is a former Great Britain Olympic bobsledder, now working as a television presenter and producer. He currently works as a sports commentator for the BBC, ESPN, Fox Sports, Eurosport, Channel Five, Channel 4 and CBBC.', 'title': 'Colin Bryce'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Viking: The Ultimate Obstacle Course (海筋肉王 ～バイキング～ , Kaikinnikuō ~Baikingu~ , literally "Sea Muscle King VIKING") , sometimes abbreviated to Viking: TUOC, is a Japanese obstacle course endurance game show using an obstacle course produced by Fuji TV and . The English version of Viking is produced by ESPN2 with two American commentators calling the action. In Europe it airs on Eurosport 2 with the American commentators in the first season and British commentator Colin Bryce in the second. In the Philippines, Viking was aired in TV5 and hosted by Brod Pete, Richard del Rosario, and Gabe Mercardo. In Taiwan on JET TV in its original form with Chinese subtitles and Thailand on Channel 9 MCOT in Thai program "แชมป์ เฉือน แชมป์" (Champ VS Champ) in 2009, later this program are broadcast other Japanese game show like Original Iron Chef, Unbeatable Banzuke and Sasuke Ninja Warrior. The entire show is broadcast from Tokyo Bay.', 'title': 'Viking: The Ultimate Obstacle Course'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Makoto Nagano (長野 誠 , Nagano Makoto , born March 30, 1972 in Kitakata, Miyazaki) (sometimes known as the World\'s Strongest Fisherman) is a commercial fisherman and the captain of his vessel, F/V "Konpira Maru 50" (第50金比羅丸 ) (He used to be captain of the F/V "Konpira Maru 28" (第28金比羅丸 ) ) and musician. He is regularly seen on the Japanese television show "Sasuke" ("Ninja Warrior") where he was one of the "SASUKE All-Stars," a group of favored competitors who were thought to possess the greatest potential in completing the four grueling obstacle courses of Ninja Warrior. He can also be seen on the lesser known precursor to Ninja Warrior, Viking: The Ultimate obstacle course, where he was the only competitor to make it to the final round.', 'title': 'Makoto Nagano'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Shahu Bhonsle (1682–1749 CE) was the fifth Chhatrapati of the Maratha Empire created by his grandfather, Shivaji. Shahu, he was taken prisoner with his mother in 1689 by Mughal General,Nusrat Jang. He came out of captivity by the Mughals and defeated his aunt Tarabai in an internecine conflict to gain the throne in 1708. After the death of Aurangzeb, leading Mughal courtiers released Shahu with a force of fifty men, thinking that a friendly Maratha leader would be a useful ally.', 'title': 'Shahu I'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Rajaram II Bhonsle, also known as Ramaraja, was the 6th monarch of Maratha Empire. He was an adopted son of Chhattrapati Shahu. Tarabai had presented him to Shahu as her own grandson and used him to grab power after Shahu's death. However, after being sidelined, she stated that Rajaram II was only an imposter. Nevertheless, Peshwa Balaji Baji Rao retained him as the titular Chhatrapati. In reality, Peshwa and other chiefs had all the executive power, while Rajaram II was only a figurehead.", 'title': 'Rajaram II of Satara'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Maratha Navy refers to the naval wing of the armed forces of Maratha Empire, which existed from around mid-17th century to mid-18th century in India. The founder of Maratha Empire Chhatrapati Shivaji is considered as the "Father of Indian Navy".', 'title': 'Maratha Navy'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "New Palace, Kolhapur is a palace situated in Kolhapur, in the Indian state of Maharastra. It was constructed between 1877–1884. Being an excellent specimen of architecture built in black polished stone, it has been an attraction for tourists. It has extensive premises with a garden, fountain and wrestling ground. The whole building is eight-angled and has a tower in the middle. The clock on it was fixed in 1877. At separate distances there are small towers. On every glass are painted the events in Shivaji's life. There is a zoo and a ground lake. Even today, it is the residence of Chhatrapati Shahu, the direct descendent of Chhatrapati Shivaji Maharaj, the founder of Maratha Empire.", 'title': 'New Palace, Kolhapur'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Maynak Bhandari was one of the first chiefs or Admiral of the Maratha Navy under Chhatrapati Shivaji Maharaj, and helped in both building the Maratha Navy and safeguarding the coastline of the emerging Maratha Empire. Under his leadership, Maratha navy won the battle at Khanderi fort near Alibaug. He was belong to the Bhandari caste. Along with Daria Sarang, another admiral who served Maharaj, Bhandari commanded a naval fleet of 200 ships. Their official titles of Mai Nayak Bhandari and Daria Sarang translate to Water Leader and Sea Captain, respectively. The Maratha Navy was the forerunner of India's present-day Coast Guard. A memorial has been built to Ram Nayak Bhandari at Bhatye Village, close to Ratnagiri town.", 'title': 'Maynak Bhandari'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Baji Rao (18 August 1700 – 28 April 1740) was a general of the Maratha Empire in India. He served as "Peshwa" (Prime Minister) to the fifth Maratha Chhatrapati (Emperor) Shahu from 1720 until his death. He is also known by the name Bajirao Ballal.', 'title': 'Baji Rao I'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Baloji Kunjar / Kunjir (17**–1816) (Marathi: बालाजी कुंजर / कुंजीर) was Maratha Sardar and Minister of Affairs in service of Peshwa Baji Rao II. He was Peshwa Baji Rao II's favorite. After the death of Peshwa Sawai Madhavrao, there was debates for the position of Peshwa among the maratha empire. Balaji Kunjar performed a successful role to convey most friendly declaration and assurance between Baji Rao II and Nana Phadanvis, to appoint Baji Rao II as peshwa of Maratha Empire. Peshwa Baji Rao II and Nana Phadanvis awarded inam (Jagir) to him in 14 villages near Purandhar fort, for his role. He performed successful role in administration of maratha empire and as affairs minister or diplomat (vakil) for Peshwa Baji Rao II. He along with his son Pandoji Kunjar and Narayan, enjoyed the position as Sur-Patil (सर-पाटील) at Pune Punch Mahals during the era of Peshawa Baji Rao II. He along with his family has long enjoyed the privileges of sar-patil of 360 villages and towns in the Subha of Poona.", 'title': 'Balaji Kunjar'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Shreemant Chimaji Ballal Peshwa (aka Chimaji Appa)(1707–1740) was the son of Balaji Vishwanath Bhat and the younger brother of Bajirao Peshwa of Maratha Empire. He was an able military commander who liberated the western coast of India from Portuguese rule. The high watermark of his career was the capture of Vasai fort from the Portuguese in a hard fought battle.', 'title': 'Chimaji Appa'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Maratha emperors, from the early 17th century to the early 18th century, built and ruled the Maratha Empire on the Indian subcontinent, mainly corresponding to the modern countries of Bangladesh, India and Pakistan. ) Their power rapidly dwindled during the 18th century and the last of the emperors was deposed in 1818, with the establishment of the British Raj. At their empire's greatest extent in the late 17th and early 18th centuries, they controlled much of the Indian subcontinent, extending from Bengal in the east to Atak and Sindh in the west, Kashmir in the north to the Kaveri basin in the south. Peshwas served as subordinates to the Chhatrapati (the Maratha king), but later, they became the leaders of the Marathas, and the Chatrapati was reduced to a nominal ruler. During the last years of the Maratha Empire, Peshwe were instrumental in expanding the Maratha empire to this extent.", 'title': 'Maratha emperors'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Balaji Vishwanath (Bhatt) was born into a Konkanastha Brahmin (aka Chitpavan) family. The family hailed from the coastal Konkan region of present-day Maharashtra and were the hereditary Deshmukh for Shrivardhan under the Siddi of Janjira. He went out in search of employment to the upper regions of western ghats and worked as a mercenary trooper under various Maratha generals. According to Kincaid & Parasnis, Balaji Vishwanath entered the Maratha administration during the reign of Chhatrapati Sambhaji or the regency of his brother, Rajaram. Later he served as an accountant for the Maratha general, Dhanaji Jadhav, at Janjira. Between 1699 and 1702, he served as the "Sar-subhedar" or head-administrator at Pune and from 1704 to 1707 as Sarsubedar of Daulatabad. By the time Dhanaji died, Balaji had proven himself as an honest and able officer.Balaji fell out with Dhanaji\'s son and successor , Chandrarao Jadhav and went over to the newly released Maratha ruler Chhatrapati Shahu who took note of his abilities and appointed Balaji as his assistant ("c."1708).', 'title': 'Balaji Vishwanath'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Flicker is the upcoming debut studio album by Irish singer and songwriter Niall Horan. It is scheduled for release on October 20, 2017, through Neon Haze Music and Capitol Records. " This Town" was released on 29 September 2016, as the album\'s lead single, followed by 2017 singles "Slow Hands" and "Too Much to Ask".', 'title': 'Flicker (album)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Only One Direction is an international production and theatre show about English-Irish boyband One Direction. The band has performed to hundreds of thousands worldwide. In October 2015, Only One Direction - The One Direction Story opened in London's West End.", 'title': 'Only One Direction'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Up All Night is the debut studio album by English-Irish group One Direction, released by Syco Records in November 2011 in Ireland and the United Kingdom, followed by a worldwide release during 2012. Four months after finishing third in the seventh series of British reality singing contest "The X Factor" in December 2010, One Direction began recording the album in Sweden, UK and the United States, working with a variety of writers and producers. The album is predominantly a pop music album which orientates into pop rock, dance-pop, teen pop and power pop. The album\'s lyrical content regards being young, relationships, heartbreak and empowerment. Staged in support of the album, One Direction performed the album\'s songs live on televised shows, at awards ceremonies, and during their worldwide Up All Night Tour.', 'title': 'Up All Night (One Direction album)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '" Midnight Memories" is the third studio album by British-Irish boy band One Direction, released on 25 November 2013 by Columbia Records, Syco Music and Sony Music. The album was described as having a "slightly rockier tone" than their previous efforts. It has become the fastest-selling album in Amazon UK\'s history, breaking the record set by One Direction\'s previous release, "Take Me Home" (2012). The album debuted at number one on the US "Billboard" 200, making One Direction the first group in history to debut at number one in the US with their first three albums. The album was preceded by the release of the singles "Best Song Ever" and "Story of My Life".', 'title': 'Midnight Memories'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Louis William Tomlinson (born Louis Troy Austin; 24 December 1991) is an English singer and songwriter. He is known as a member of the boy band One Direction. Tomlinson began his career as an actor, appearing in ITV drama film "If I Had You" and the BBC drama "Waterloo Road". In 2010, he became a member of One Direction after being eliminated as a solo artist on the British music competition series "The X Factor". Tomlinson is one of the main songwriters of One Direction\'s repertoire. Following the band\'s hiatus, Tomlinson released the singles "Just Hold On" and "Back to You". The latter will be included in his debut studio album, which will be released in 2017 by Epic Records.', 'title': 'Louis Tomlinson'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'One Direction: This Is Us is a 2013 British-American 3-D documentary concert film centering on British-Irish group One Direction. It opened in the United Kingdom on 29 August 2013, followed a day later in the United States. The movie shows many clips and songs of One Direction.', 'title': 'One Direction: This Is Us'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Liam James Payne (born 29 August 1993) is an English singer and songwriter. He rose to fame as a member of the boy band One Direction. Payne made his debut as a singer when he auditioned for the British television series "The X Factor" in 2008. After being eliminated as a solo performer, he auditioned again in 2010 and was put into a group with four other contestants to form One Direction. One Direction has released five commercially successful albums, performed on four worldwide tours, and won multiple awards.', 'title': 'Liam Payne'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'One Direction: Where We Are – The Concert Film, also known as One Direction: Where We Are - Live from San Siro Stadium is the second concert film by English-Irish boy band One Direction and the sequel to "". The film takes place during the 28 and 29 June 2014 shows of the band\'s Where We Are Tour at San Siro Stadium in Milan, Italy. It contains a 15-minute interview with the band with exclusive behind-the-scenes footage.', 'title': 'One Direction: Where We Are – The Concert Film'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Take Me Home is the second studio album by British-Irish group One Direction, released on 9 November 2012 by Syco Music and Columbia Records. As a follow-up to One Direction\'s internationally successful debut album "Up All Night" (2011), "Take Me Home" was written in groups and has an average of just under five songwriters per track. Largely recorded and composed in Sweden during 2012, Savan Kotecha, Rami Yacoub and Carl Falk, who composed One Direction\'s hits, "What Makes You Beautiful" and "One Thing", spent six months in Stockholm developing songs for the album, and were able to shape melodies around the members\' tones.', 'title': 'Take Me Home (One Direction album)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Niall James Horan (born 13 September 1993) is an Irish singer and songwriter. He is best known as a member of the boy band One Direction. In 2010, Horan auditioned as a solo artist for British televised singing competition "The X Factor". After being eliminated as a solo performer, Horan joined four other contestants to form One Direction. The band has released five commercially successful albums, performed on four worldwide tours, and won a number of awards.', 'title': 'Niall Horan'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Almost Perfect is a 2011 drama film written and directed by Bertha Bay-Sa Pan starring Kelly Hu, Ivan Shaw, Edison Chen, Roger Rees, Kristy Wu, and Tina Chen. Pan received an HBO Emerging Filmmaker Award at the 2011 Philadelphia Asian American Film Festival for the film.', 'title': 'Almost Perfect (film)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Twins Effect II is a 2004 Hong Kong action fantasy film directed by Corey Yuen and Patrick Leung. The film is a sequel to "The Twins Effect" (2003), but has a completely different story from the first film. It starred Charlene Choi and Gillian Chung of Cantopop duo Twins in the leading roles. Co-stars include Donnie Yen, Daniel Wu, Edison Chen, Wilson Chen, Tony Leung Ka-fai, Qu Ying, Fan Bingbing and Jim Chim. Jackie Chan also makes a cameo appearance, along with his son Jaycee Chan who is in his debut. The film\'s original English working title was Huadu Chronicles: Blade of Rose and its US DVD release title is Blade of Kings.', 'title': 'The Twins Effect II'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Mark Kwok Kin Ming (also "Kwok Kin Ming", ; born June 20, 1977) is a Hong Kong former swimmer, who specialized in middle-distance freestyle but also competed in butterfly and individual medley. He is a two-time Olympian (1996 and 2000), and a bronze medalist at the 1998 Asian Games in Bangkok, Thailand. He also holds numerous Hong Kong records in 200, 400, and 800 m freestyle, and retains a dual resident status to compete internationally for his father\'s homeland. While studying in the United States, Kwok has competed for the USC Trojans, and has received four All-American honors at the NCAA Men\'s Swimming and Diving Championships in four consecutive seasons.', 'title': 'Mark Kwok (swimmer)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'EDISON also known as 陳冠希EDISON was released on November 30, 2000 by Hong Kong pop singer-actor Edison Chen.', 'title': 'Edison Chen (EP)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Edison Koon-hei Chen (born 7 October 1980) is a Hong Kong film actor, musician, producer, entrepreneur, and fashion designer. Chen is also the founder of "CLOT Inc.", and the CEO of Clot Media Division Limited.', 'title': 'Edison Chen'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Lau Kwok Kin (; born 17 January 1977) is a fencer from Hong Kong, China who won a bronze medal at the 2006 Asian Games in the men's foil team competition. He also competed at the 2004 and 2008 Olympic Games", 'title': 'Lau Kwok Kin'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Kwok Kin Pong (, born 30 March 1987 in Hong Kong) is a Hong Kong professional footballer playing for Hong Kong Premier League club HK Pegasus. He plays as a defender or midfielder. As he resembles Hong Kong artist and singer Edison Chen, he was given the nickname 'Edison'.", 'title': 'Kwok Kin Pong'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Sniper () is a 2009 Hong Kong action thriller film directed by Dante Lam and starring Richie Jen, Edison Chen and Huang Xiaoming, as top snipers for the Hong Kong Police Force. The film was originally set to be released in May 2008, but was delayed due to the Edison Chen photo scandal. This is Chen's final film in Hong Kong as of 2015.", 'title': 'The Sniper (2009 film)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Ed Is On is the first Mandarin language album by Hong Kong singer-actor Edison Chen.', 'title': 'Ed Is On'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Dr. Kwok Kin Poon (潘國鍵, 1949- ) was born in Guangdong, China. He is a historian, a teacher, a Chinese calligrapher as well as a columnist. He studied under the renowned Chinese historian, Keng-wang Yen (), at the Chinese University of Hong Kong (CUHK) in the seventies, and eventually obtained his B.A., M.Phil. degrees, as well as a Diploma in Education from the CUHK. Subsequently, he obtained his M.A. and Ph.D. degrees from the University of Hong Kong, and a M.Ed degree from the University of Toronto. One of his major contributions to the studies of Chinese History is his book "The Northern Wei State and Juan-juan Nomadic Tribe"《北魏與蠕蠕關係研究》.', 'title': 'Kwok Kin Poon'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Championship Fighting Alliance (CFA) is a mixed martial arts (MMA) based promotion company located in Miami Lakes, Florida. It was founded by former MMA fighter and promoter Jorge De La Noval in 2011. It has currently produced 10 live events. Fallon Fox, who currently is signed to fight for CFA, is the first openly transgender MMA fighter in history. On May 24, 2013, CFA will be hosting CFA 11, their 11th event at the Bankunited Center located on the University of Miami campus. Fighter 411 reported that CFA had held the most events in Florida during the 2012-2013 season.', 'title': 'Championship Fighting Alliance'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Christopher James "Chris" Weidman (born June 17, 1984) is an American mixed martial artist. He is the former UFC Middleweight Champion. He is currently ranked as the #6 middleweight in the world. In 2013, he earned worldwide prominence by becoming the first man to defeat Anderson Silva inside the UFC to become the Middleweight Champion, which he held for approximately two and a half years. Chris Weidman successfully defended the belt three times before losing it to Luke Rockhold.', 'title': 'Chris Weidman'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Demetrious Khrisna Johnson (born August 13, 1986) is an American mixed martial artist. He is the first ever and the current Flyweight Champion of the Ultimate Fighting Championship (UFC). He currently holds the longest active championship reign at ten title defenses. He is also the #1 ranked pound for pound MMA fighter in the world. Known for his quick striking and elusive movement, Johnson has also landed the most takedowns in UFC Flyweight history and holds the record for the latest finish in UFC history with a submission win at 4:59 of the fifth round against Kyoji Horiguchi. He is also the only UFC fighter to record over 10 takedowns in three different fights.', 'title': 'Demetrious Johnson (fighter)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'J. "Skip" Hall is a former mixed martial artist and IBM sales manager. At 57, "Skip" claimed to be the oldest pro-debuting fighter, and in 2008 at the age of 63 he gained a measure of notoriety as an unusually old combat sports athlete. He was a participant in the Jasper City Slugfest in August 2006 against former UFC Superfight Champion Dan Severn, and retired in 2009 from active MMA fighting after declaring himself "Oldest Active MMA Fighter in history."', 'title': 'Skip Hall (MMA)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Joanna Jędrzejczyk (] ; born August 18, 1987) is a Polish mixed martial artist and former Muay Thai kickboxer who competes in the women's strawweight division of the Ultimate Fighting Championship. She is the current UFC Women's Strawweight Champion and the third European (and only Polish) champion in UFC history after Bas Rutten in 1999 and Andrei Arlovski in 2005. As of May 2017, she is the consensus #1 female strawweight, and #1 pound-for-pound female MMA fighter in the world. She is also currently the #8 pound-for-pound fighter in the UFC mixed gender rankings, making her the top female on the list.", 'title': 'Joanna Jędrzejczyk'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Larry Jamill Kelly (born October 25, 1977) is an American freestyle wrestler. He represented the United States at the 2004 Summer Olympic Games where he earned a silver medal. Up until August 2010 he was the head coach of Dallas Dynamite Wrestling Club in Dallas, Texas. In 2015, he became a guest wrestling coach for Daniel Cormier, Luke Rockhold and Cain Velasquez, all from the American Kickboxing Academy.', 'title': 'Jamill Kelly'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Daniel Jeffery Henderson (born August 24, 1970) is an American former mixed martial artist and Olympic wrestler, who last competed as a middleweight in the Ultimate Fighting Championship. He was the last Strikeforce Light Heavyweight Champion and was the last Welterweight (80 kg ) and Middleweight (95 kg ) champion of Pride Fighting Championships. Additionally, Henderson was the Brazil Open '97 Tournament Champion, the UFC 17 Middleweight Tournament Champion, the Rings: King of Kings 1999 Tournament Champion and the Pride Weltwerweight Grand Prix Tournament Champion. During his career, Henderson also challenged for the UFC Middleweight Championship (2x), the UFC Light Heavyweight Championship and the Strikeforce Middleweight Championship. He was the first mixed martial artist to concurrently hold two titles in two different weight classes in a major MMA promotion. At the time of his retirement after UFC 204, he was the oldest fighter on the UFC roster. Known to be one of the greatest mixed martial artists of all time having defeated a total of seventeen MMA world champions across four major MMA promotions (UFC, PRIDE FC, Strikeforce, and RINGS).", 'title': 'Dan Henderson'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Khalid Bin Hamad Al Khalifa Mixed Martial Arts (KHK MMA) is a martial arts organization based in Bahrain. It was founded under the patronage of His Highness Khalid bin Hamad Al Khalifa for its current CEO and professional MMA fighter Mohammed "The Hawk" Shahid in February 2015. Fighters competing under KHK MMA banner include: former UFC lightweight champion Frankie Edgar, UFC lightweight contender Khabib Nurmagomedov, UFC lightweight fighter Islam Makhachev, Bellator fighter James Gallagher, 2-time IMMAF champion Jose "Shorty" Torres, former UFC fighter and current Titan FC contender Alex Soto, and current Desert Force fighter Hamza Kooheji. KHK MMA activities include: coaching pro fighters, developing amateur MMA, promoting martial arts events, fitness gyms, and a sports gear brand.', 'title': 'KHK MMA'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Luke Skyler Rockhold (born October 17, 1984) is an American mixed martial artist competing in the UFC, where he is the former UFC Middleweight Champion. He won the title on December 12, 2015 by defeating prior champion, the undefeated Chris Weidman via 4th round TKO. He lost his belt in his first title defense against Michael Bisping, who stepped in after Weidman pulled out of their scheduled rematch. A two-time world champion, Rockhold also won the Strikeforce Middleweight Championship by defeating Ronaldo Souza on September 10, 2011 via unanimous decision. Rockhold defended the title twice and was the last man to hold the belt, before Strikeforce was officially taken over by the UFC. He is currently ranked the #2 middleweight and #12 official pound-for-pound fighter by the UFC and other publications like Fight Matrix and Sherdog. Luke is also an avid surfer and skateboarder.', 'title': 'Luke Rockhold'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Kamen Georgiev (Bulgarian: Камен Георгиев ) is a Bulgarian MMA fighter who competes in the Light heavyweight division. World MMA title holder under ISFA rules 2016. He is a coach of the national combat wrestling team, and an international referee with a FICW license "A" class in combat wrestling. Also Kamen Georgiev has won World championships and accolades in multiple sports, most notably in MMA ISFA PRO (Light-heavyweight champion 2016-), World Combat Wrestling Championship(Champion under 100kg, 2015, 2016), World Sanda Championship (Heavyweight Champion 2009, 2011) and FIAS World Combat Sambo Cup(Champion under 90kg, 2014).', 'title': 'Kamen Georgiev'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'City of Gold is a 2010 Bollywood film released in both Hindi and Marathi languages. The film was directed by Mahesh Manjrekar, who has directed critically acclaimed films in the past like "Astitva" and "Viruddh... Family Comes First". The film is adapted from the play "Adhantar" by Jayant Pawar, who also co-wrote the screenplay, and explores the life of Mumbai\'s mill workers after they were rendered jobless in the early 1980s, when the Mumbai mills shut down in the post Great Bombay Textile Strike period, and soon made way for skyscrapers and shopping malls. The film opened to mixed reviews, though it was commended for its theme, and acting. The name of the Marathi version of this film is "Lalbaug Parel", while the Hindi version was released as "City of Gold".', 'title': 'City of Gold (2010 film)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Sons of the Desert was an American country music band founded in 1989 in Waco, Texas by brothers Drew Womack (lead vocals, rhythm guitar) and Tim Womack (lead guitar, background vocals), along with Scott Saunders (keyboards), Doug Virden (bass guitar, background vocals), and Brian Westrum (drums). The band released "Whatever Comes First" for Epic Records Nashville in 1997, and recorded a second album for Epic which was not released. " Change" followed in 2000. Counting two singles from the unreleased album, Sons of the Desert charted eight times on the "Billboard" Hot Country Songs charts, including the top ten hit "Whatever Comes First"; they were also guest vocalists on Lee Ann Womack\'s 2000 hit "I Hope You Dance" and Ty Herndon\'s "It Must Be Love", both of which reached No.\xa01 on that chart. Following the band\'s disestablishment, Drew Womack became a solo artist.', 'title': 'Sons of the Desert (band)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Panic Attack" is a song by British rock band The Paddingtons, released on 4 April 2005. It is the first single to be taken from their début album "First Comes First". Overall, it is the band\'s second single behind "21", which was released the previous year, and which was re-recorded for "First Comes First".', 'title': 'Panic Attack (The Paddingtons song)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Virruddh... Family Comes First (English: "Against") is an Indian Hindi drama film, released in 2005, directed by Mahesh Manjrekar. The film stars Amitabh Bachchan, Sharmila Tagore, Sanjay Dutt and John Abraham. "Viruddh" is not a musical, instead the soundtrack is primarily used as background. Marathi movie \'Kokanastha\' also written and directed by Mahesh Manjrekar has a similar plot.', 'title': 'Viruddh... Family Comes First'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Whatever Comes First" is the a debut song written by Drew Womack, Walt Aldridge and Brad Crisler, and recorded by American country music group Sons of the Desert. It was released in February 1997 as the first single and title track from the album "Whatever Comes First". The song reached #10 on the "Billboard" Hot Country Singles & Tracks chart.', 'title': 'Whatever Comes First (song)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Crepis, commonly known in some parts of the world as hawksbeard or hawk\'s-beard (but not to be confused with the related genus "Hieracium" with a similar common name), is a genus of annual and perennial flowering plants of the family Asteraceae superficially resembling the dandelion, the most conspicuous difference being that "Crepis" usually has branching scapes with multiple heads (though solitary heads can occur). The genus name "Crepis" derives from the Greek "krepis", meaning "slipper" or "sandal", possibly in reference to the shape of the fruit.', 'title': 'Crepis'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Isatis is a genus of about 30 species of flowering plants in the family Brassicaceae, native to the Mediterranean region east to central Asia. The genus includes woad ("Isatis tinctoria").', 'title': 'Isatis'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Mahesh Vaman Manjrekar (Marathi: महेश वामन मांजरेकर ) (born 16 August 1958) is an Indian film director, actor, writer and producer. He is credited with directing the critically acclaimed films "" (1999), "Astitva" (2000) and "Viruddh... Family Comes First" (2005). He has won a National Film Award and two Star Screen Awards. Besides direction, he has acted in several films, including some of his own productions. He first gained acclaim as an actor for his performance in the 2002 film "Kaante", and later played negative roles in the Telugu film "Okkadunnadu" (2007) and as the gangster Javed in the film "Slumdog Millionaire" (2008). He played the role of Shivaji Maharaj in Marathi film "Me Shivajiraje Bhosale Boltoy". He also played the role of Harpist Dongara in the "Aakhri Chunauti" series of episodes in "C.I.D.". Manjrekar was acclaimed for the negative role as inspector D.R. Talpade in the movie Wanted starring superstar Salman Khan.', 'title': 'Mahesh Manjrekar'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Howard William Thomas Hobbs (born 22 January 1950) is an Australian politician who represented the seat of Warrego in the Legislative Assembly of Queensland from 1 November 1986 until his retirement at the 31 January 2015 state election. He was a member of the National Party of Australia until the Queensland division merged with the Liberal party to form the Liberal National Party of Queensland. Hobbs was Shadow Minister for Local Government and Planning and for Communities from 28 September 2005 until the LNP entered government following the 2012 election. As the longest-serving member of the Legislative Assembly, he presides at the election of Speakers. When he did so in 2009, Dean Wells equaled him in seniority, but Hobbs had taken the oath first because his name comes first alphabetically, so he took the chair as Presiding Member. As Wells lost his seat at the 2012 election, Hobbs alone was the longest-serving member until his retirement at the 2015 state election.', 'title': 'Howard Hobbs'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Whatever Comes First is the debut album of the American country music band Sons of the Desert. The album was released in 1997 (see 1997 in country music) on Epic Records. It produced three singles for them on the "Billboard" country singles charts: the Top Ten "Whatever Comes First", as well as "Leaving October" and "Hand of Fate".', 'title': 'Whatever Comes First'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Mall Wood Green is a large shopping centre and residential complex in Wood Green, north London. It is generally still referred to by its former name of Wood Green Shopping City; the signage on the building still uses that name.', 'title': 'The Mall Wood Green'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Haringey London Borough Council is the local authority for the London Borough of Haringey in Greater London, England. It is a London borough council, one of 32 in the United Kingdom capital of London. Haringey is divided into 19 wards, each electing three councillors. Haringey London Borough Council comprises 48 Labour Party councillors, and 9 Liberal Democrats. The council was created by the London Government Act 1963 and replaced three local authorities: Hornsey Borough Council, Tottenham Borough Council and Wood Green Borough Council. The next election to the authority will be in 2018.', 'title': 'Haringey London Borough Council'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'White Hart Lane Community Sports Centre, also known as the New River Stadium is a rugby league and athletics stadium in Wood Green, Haringey, north London, England that is home to London Skolars rugby league club, Enfield and Haringey Athletic Club, Wood Green Weightlifting Club, Hashtag United F.C. (YouTube based football club), Haringey Rhinos rugby union club, Haringey Cycling Club, and the Next Level Football League.', 'title': 'White Hart Lane Community Sports Centre'}
