 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Heartlands High School is a state secondary school located in Wood Green in the London Borough of Haringey. It welcomed its first students in September 2010. The headteacher is Mr. Simon Garrill.', 'title': 'Heartlands High School'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Haringey Heartlands is a currently ongoing urban regeneration project in the London Borough of Haringey, in north London, England. The site is located west of Shopping City in Wood Green. The aim of the development is "to create a vibrant and attractive new urban quarter which acts as the civic and cultural Heart of Haringey, integrating with and benefiting wider communities."', 'title': 'Haringey Heartlands'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Wood Green is a London Underground station on the Piccadilly line. The station is between Turnpike Lane and Bounds Green stations and is in Travelcard Zone 3. It is located at junction of High Road, Wood Green and Lordship Lane. It serves Wood Green Shopping City and the nearby Haringey Council administrative complex as well as a densely populated residential area. It is also the closest tube station to the Alexandra Palace Venue.', 'title': 'Wood Green tube station'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Alexandra Palace railway station (originally named Wood Green and later Wood Green (Alexandra Park)) is in the London Borough of Haringey in north London, and is in Zone 3. The station, and all trains serving it, are operated by Great Northern. Trains mostly go to and from Moorgate on weekdays and weekends.', 'title': 'Alexandra Palace railway station'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Wood Green War Memorial is located on the High Road, Wood Green, in the London Borough of Haringey. It was erected in 1920 and paid for by public subscription of the people of Wood Green to remember the men of the area who died during the First World War. It was subsequently adapted to include the dead of the Second World War. It is grade II listed with Historic England.', 'title': 'Wood Green War Memorial'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'London Skolars R.L.F.C. are a professional rugby league club based at the New River Stadium, Wood Green, Haringey in north London. They were founded in 1995 and have been professional since 2003, operating in the Kingstone Press League 1 in the 2015 season. They also run an A-team (formerly known as "Haringey Hornets") that play in the South Premier Division of the Rugby League Conference.', 'title': 'London Skolars'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Arielle Dombasle (born April 27, 1953) is an American-born French singer, actress, director and model. Her breakthrough roles were in Éric Rohmer\'s "Pauline at the Beach" (1983) and Alain Robbe-Grillet\'s "The Blue Villa" (1995). She is best known to American audiences for her appearances on "Miami Vice" where she played Kelly in Season 2, episode 12 of Miami Vice. The episode was entitled "Definitely Miami". She was also one of the main characters in the 1984 miniseries "Lace." Since 1978 she has released twenty singles and nine albums.', 'title': 'Arielle Dombasle'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '""Miami Vice" Theme" is a musical piece composed and performed by Jan Hammer as the theme to the television series "Miami Vice". It was first presented as part of the television broadcast of the show in September 1984 and released as a single in 1985, peaking at the number one spot on the "Billboard" Hot 100. It was the last instrumental to top the Hot 100 until 2013, when "Harlem Shake" by Baauer reached number one. It also peaked at number five in the UK and number four in Canada. In 1986, it won Grammy Awards for "Best Instrumental Composition" and "Best Pop Instrumental Performance." This song, along with Glenn Frey\'s number-two hit "You Belong to the City", put the "Miami Vice" soundtrack on the top of the US album chart for 11 weeks in 1985, making it the most successful TV soundtrack of all time until 2006 when Disney Channel\'s "High School Musical" beat its record.', 'title': 'Miami Vice Theme'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Edward James Olmos (born February 24, 1947) is an American actor and director. Among his most memorable roles are William Adama in the re-imagined "Battlestar Galactica", Lieutenant Martin "Marty" Castillo in "Miami Vice", teacher Jaime Escalante in "Stand and Deliver", patriarch Abraham Quintanilla, Jr. in the film "Selena", Detective Gaff in "Blade Runner", and narrator El Pachuco in both the stage and film versions of "Zoot Suit". In 1988, Olmos was nominated for an Academy Award for Best Actor in a Leading Role for the film "Stand and Deliver".', 'title': 'Edward James Olmos'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'In the television series, "Miami Vice", firearms took a key role. Episodes such as "Evan" revolved around them, while the characters themselves also used several firearms during the series. Sonny Crockett (played by Don Johnson) was to have used a SIG Sauer P220, but this was replaced by the then more modern Bren Ten. The importance of the firearms in "Miami Vice" is demonstrated by Galco International, which provided the holster used by Don Johnson on the show, naming its holster the "Miami Classic".', 'title': 'Firearms in Miami Vice'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"You Belong to the City" is a song written by Glenn Frey (of the Eagles) and Jack Tempchin, and recorded by Frey during his solo career. It was written specifically for the television show "Miami Vice" in 1985. The song nearly reached the top of the charts, peaking at number two (behind Starship\'s "We Built This City") on the US "Billboard" Hot 100 chart, although it did reach the top of the "Billboard" Top Rock Tracks chart. This song, along with Jan Hammer\'s "Miami Vice Theme", helped the "Miami Vice" soundtrack album reach the top spot of the "Billboard" 200 chart for 11 weeks in 1985, making it the best-selling album of the year and the most successful TV soundtrack of all time. While Frey performed this song live when touring with the Eagles, he stopped doing so in 2005. A version of the Eagles performing the song can be found on their DVD "Farewell Tour I: Live from Melbourne" released that year.', 'title': 'You Belong to the City'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Terrance Bernard Jackson (born January 10, 1976) is an American former college and professional football player who was a fullback, running back and special teams player in the National Football League (NFL) for seven seasons during the 1990s and 2000s. Jackson played college football for the University of Florida, and was a member of a national championship team. Thereafter, he played professionally for the San Francisco 49ers of the NFL. Jackson is now a college football administrator at his alma mater.', 'title': 'Terry Jackson (running back)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Donald Wayne Johnson (born December 15, 1949) is an American actor, producer, director, singer, and songwriter. He played the role of James "Sonny" Crockett in the 1980s television series "Miami Vice" and had the eponymous lead role in the 1990s cop series "Nash Bridges". Johnson is a Golden Globe–winning actor for his role in "Miami Vice", the American Power Boat Association\'s 1988 World Champion of the Offshore World Cup, and has received a star on the Hollywood Walk of Fame.', 'title': 'Don Johnson'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Jan Hammer (] ) (born 17 April 1948) is a Czech-born American musician, composer and record producer. He first gained his most visible audience while playing keyboards with the Mahavishnu Orchestra in the early 1970s, as well as his film scores for television and film including "Miami Vice Theme" and "Crockett\'s Theme", from the popular 1980s program, "Miami Vice". He has continued to work as both a musical performer and producer, expanding to producing film later in his career.', 'title': 'Jan Hammer'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'C. Bernard Jackson (November 4, 1927 – July 16, 1996) was an award-winning American playwright who founded the Inner City Cultural Center in Los Angeles. Inner City was one of the first arts institutions in the United States to promote multiculturalism. The facility nurtured the careers of numerous performers including Beah Richards, George Takei, Edward James Olmos, Nobu McCarthy and Forest Whitaker.', 'title': 'C. Bernard Jackson'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Philip Michael Thomas (born May 26, 1949) is an American actor. Thomas\' most famous role is that of detective Ricardo Tubbs on the hit 1980s TV series "Miami Vice". His first notable roles were in "Coonskin" (1975) and opposite Irene Cara in the 1976 film "Sparkle". After his success in "Miami Vice", Thomas appeared in numerous made-for-TV movies and advertisements for telephone psychic services. He served as a spokesperson for cell phone entertainment company Nextones, and supplied the voice for the character in the video games "" and "".', 'title': 'Philip Michael Thomas'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Revenue Act of 1913, also known as the Tariff Act, the Underwood Tariff, the Underwood Act, the Underwood Tariff Act, or the Underwood-Simmons Act (ch. 16, 38\xa0Stat. 114 , October 3, 1913), re-imposed the federal income tax after the ratification of the Sixteenth Amendment and lowered basic tariff rates from 40% to 25%, well below the Payne-Aldrich Tariff Act of 1909. It was signed into law by President Woodrow Wilson on October 3, 1913 and was sponsored by Alabama Representative Oscar Underwood.', 'title': 'Revenue Act of 1913'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Tariff Act of 1890, commonly called the McKinley Tariff, was an act of the United States Congress framed by Representative William McKinley that became law on October 1, 1890. The tariff raised the average duty on imports to almost fifty percent, an act designed to protect domestic industries from foreign competition. Protectionism, a tactic supported by Republicans, was fiercely debated by politicians and condemned by Democrats. The McKinley Tariff was replaced with the Wilson–Gorman Tariff Act in 1894, which promptly lowered tariff rates.', 'title': 'McKinley Tariff'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Thomas Bowman (May 25, 1848 – December 1, 1917) was a local official, newspaper publisher, and one-term Democratic U.S. Representative from Iowa's 9th congressional district. Benefiting from an electoral backlash in 1890 against Republicans for their support of the McKinley Tariff, Bowman's election was a rare nineteenth century Democratic win in traditionally Republican southwestern Iowa.", 'title': 'Thomas Bowman (Iowa politician)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The 1890 United States elections occurred in the middle of Republican President Benjamin Harrison's term. Members of the 52nd United States Congress were chosen in this election. The Republicans suffered major losses due to the Panic of 1890 and the unpopularity of the McKinley Tariff. The Populist Party also emerged as an important third party.", 'title': 'United States elections, 1890'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Sook-ja "Sue" Kim (born 1941) is a Korean-born U.S. singer. She started singing with her sisters in a group called The Kim Sisters at the age of 10 and played 13 different instruments. In 1950, the Korean War broke out and Sue Kim\'s father, Kim Hae-song, who was a famous Korean symphony orchestra conductor was captured by the North Korean army and later assassinated. Her mother, Lee Nan-young, was left with no home, no food and no money for her and her seven children. Lee was a famous Korean singer who rose to stardom with the song "Mokpo Tears." In 1953, Lee asked the children to perform with her in South Korea\'s military clubs to support their family. The GIs donated rock and roll records for the sisters to memorize and sing, and in turn the sisters received chocolate bars and alcohol, which they exchanged for food. The GIs that returned to the States spread the word about the talented trio and in 1958, Tom Ball (who later became The Kim Sisters’ manager) heard about the sisters from one of the returning GIs and went to Korea to recruit them for an Asian act that he was producing.', 'title': 'Sook-ja Kim'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Count István Tisza de Borosjenő et Szeged (archaically English: Stephen Tisza; 22 April 1861 – 31 October 1918) was a Hungarian politician, prime minister, political scientist and member of Hungarian Academy of Sciences. The prominent event in his life was Austria-Hungary\'s entry into the First World War when he was prime minister for the second time. He was later assassinated during the Chrysanthemum Revolution on 31 October 1918 - the same day that Hungary terminated its political union with Austria. Tisza supported the dual monarchy of Austria-Hungary and was representative of the then "liberal-conservative consent".', 'title': 'István Tisza'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Tariff Act of 1930 (codified at ), otherwise known as the Smoot–Hawley Tariff or Hawley–Smoot Tariff, was an act implementing protectionist trade policies sponsored by Senator Reed Smoot and Representative Willis C. Hawley and signed into law on June 17, 1930. The act raised U.S. tariffs on over 20,000 imported goods.', 'title': 'Smoot–Hawley Tariff Act'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Dingley Act of 1897 (ch. 11, 30\xa0Stat. 151 , July 24, 1897), introduced by U.S. Representative Nelson Dingley, Jr., of Maine, raised tariffs in United States to counteract the Wilson–Gorman Tariff Act of 1894, which had lowered rates. Came into effect under William McKinley the first year that he was in office. The McKinley administration wanted to slowly bring back the protectionism that was proposed by the Tariff of 1890.', 'title': 'Dingley Act'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'William McKinley (January 29, 1843 – September 14, 1901) was the 25th President of the United States from March 4, 1897 until his assassination in September 1901, six months into his second term. McKinley led the nation to victory in the Spanish–American War, raised protective tariffs to promote American industry, and maintained the nation on the gold standard in a rejection of inflationary proposals.', 'title': 'William McKinley'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Revenue Act or Wilson-Gorman Tariff of 1894 (ch. 349, §73, 28\xa0Stat. 570 , August 27, 1894) slightly reduced the United States tariff rates from the numbers set in the 1890 McKinley tariff and imposed a 2% income tax. It is named for William L. Wilson, Representative from West Virginia, chair of the U.S. House Ways and Means Committee, and Senator Arthur P. Gorman of Maryland, both Democrats.', 'title': 'Wilson–Gorman Tariff Act'}]

