 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Samuel M "Sam" Raimi ( ; born October 23, 1959) is an American film director, producer, screenwriter and actor, famous for creating the cult horror "Evil Dead" series, as well as directing the original "Spider-Man" trilogy (2002–07), the 1990 superhero film "Darkman" and the "I Will Rip Your Soul Out" scene from the 2013 remake of "Evil Dead". His most recent film is the 2013 Disney fantasy film "Oz the Great and Powerful".', 'title': 'Sam Raimi'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Grudge 2 is a 2006 American supernatural horror film and a sequel to the 2004 film, "The Grudge". Produced by Sam Raimi, the film was directed by Takashi Shimizu (director of the "Ju-on" series), written by Stephen Susco and stars an ensemble cast that includes Amber Tamblyn, Sarah Michelle Gellar, Edison Chen, Arielle Kebbel, Jenna Dewan Tatum, Teresa Palmer, Misako Uno, Matthew Knight and Takako Fuji.', 'title': 'The Grudge 2'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Stephen Susco is an American film and television screenwriter who is most famous for writing the hit movies "The Grudge" and "The Grudge 2".', 'title': 'Stephen Susco'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Grudge is a 2004 American supernatural horror film and a remake of the Japanese film, "". The film was released in North America on October 22, 2004, by Columbia Pictures, and was directed by Takashi Shimizu (director of all previous "Ju-on" films) while Stephen Susco scripted the film. The plot is told through a non-linear sequence of events and includes several intersecting subplots. The film was a box office success, making over $187 million against a $10 million budget, though it received only mixed reviews from critics.', 'title': 'The Grudge'}
