 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Red is a 2008 thriller film based on a novel by Jack Ketchum and directed by Trygve Allister Diesen and Lucky McKee. It concerns one man's revenge after his beloved dog dies in an attempted robbery. The screenplay was written by Stephen Susco based on the novel. It premiered at the Sundance Film Festival in 2008.", 'title': 'Red (2008 film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Grudge 3 is a 2009 American direct-to-video supernatural horror film and the third film in "The Grudge" series. Toby Wilkins, who had previously directed the successful film "Splinter" and the short films "Tales from the Grudge", took Takashi Shimizu\'s place as director who later served as executive producer, while Brad Keene replaced Stephen Susco as screenwriter. The film stars Johanna Braddy, Shawnee Smith and Marina Sirtis, with a special appearance by Matthew Knight (from "The Grudge 2"), and was released on DVD on May 12, 2009.', 'title': 'The Grudge 3'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"The Grudge" film series features a large cast of characters mainly created by screenwriter Stephen Susco and Takashi Shimizu. The film series focuses on people affected by a deadly curse that spreads like a virus and manifests itself in various ways, such as turning people homicidal or people being haunted, ultimately leading to their demise, if they come in contact with the curse in any way.', 'title': 'List of The Grudge characters'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Texas Chainsaw (promoted as Texas Chainsaw 3D) is a 2013 American slasher film directed by John Luessenhop, with a screenplay by Adam Marcus, Debra Sullivan and Kirsten Elms and a story by Stephen Susco, Marcus and Sullivan. It is the seventh installment in "The Texas Chainsaw Massacre" franchise and was presented in 3-D. The film serves as a direct sequel to the 1974 film "The Texas Chain Saw Massacre" (ignoring the events of the second, and films, not including the remake films). The film stars Alexandra Daddario, Dan Yeager, Trey Songz, Tania Raymonde, Scott Eastwood, Thom Barry, Paul Rae and Bill Moseley, with Gunnar Hansen and Marilyn Burns, who had appeared in the original 1974 film. The story centers on Heather, who discovers that she was adopted after learning of an inheritance from a long-lost grandmother. She subsequently takes a road trip with her friends to collect the inheritance, unaware that it includes her cousin, Leatherface, as well. Filming began in the summer of July 2011, and it was released January 4, 2013.', 'title': 'Texas Chainsaw 3D'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "The American Athletic Conference (also known as The American and sometimes abbreviated AAC) is an American collegiate athletic conference, featuring 12 member universities and three associate member universities that compete in the National Collegiate Athletic Association's (NCAA) Division I, with its football teams competing in the Football Bowl Subdivision (FBS). Member universities represent a range of private and public universities of various enrollment sizes located primarily in urban metropolitan areas in the Northeastern, Midwestern, Western, and Southern regions of the United States.", 'title': 'American Athletic Conference'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 1979 Connecticut Huskies baseball team represented the University of Connecticut in the 1979 NCAA Division I baseball season. The Huskies were led by Larry Panciera in his 18th and final year as head coach, and played as part of the Eastern College Athletic Conference, a collection of northeastern universities with no other conference affiliation. Connecticut posted a 31–13 record, won the ECAC, and reached the 1979 College World Series, their fifth appearance in the penultimate college baseball event. The Huskies lost both games in the College World Series, being eliminated by eventual champion Cal State Fullerton.', 'title': '1979 Connecticut Huskies baseball team'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The Washington Huskies baseball team is the varsity intercollegiate baseball team of the University of Washington, located in Seattle, Washington, United States. The program has been a member of the NCAA Division I Pac-12 Conference since the start of the 1960 season, preceded by the Pacific Coast Conference. The team has played at Husky Ballpark since 1998; the on-campus venue was renovated extensively for the start of the 2014 season. Lindsay Meggs has been the program's head coach since the start of the 2010 season. The program has appeared in nine NCAA Tournaments. It has won two Pac-10 North-South Division Playoffs, six Pac-10 North Division Titles, eight PCC North Division Titles, and two PCC Regular Season Championships. As of the start of the 2014 season, 18 former Huskies have appeared in the major leagues.", 'title': 'Washington Huskies baseball'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The Connecticut Huskies baseball team represents the University of Connecticut, in Storrs, Connecticut in college baseball. The program is classified in the NCAA Division I, and the team competes in the American Athletic Conference. The team is coached by Jim Penders.', 'title': 'Connecticut Huskies baseball'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Connecticut Huskies baseball program is a college baseball team that represents the University of Connecticut in the Big East Conference. The Huskies compete in the National Collegiate Athletic Association (NCAA) Division I. The current head coach is Jim Penders, who will coach his tenth season in 2013.', 'title': 'List of Connecticut Huskies head baseball coaches'}
