[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'My Dog Skip is a 2000 family drama film, directed by Jay Russell and starring Frankie Muniz, Diane Lane, Luke Wilson, and Kevin Bacon with narration by Harry Connick, Jr. Based on the autobiographical novel of the same name, the film stars Muniz as 9-year-old Willie Morris as he is given a Jack Russell terrier for his birthday, and how the dog fundamentally changes several aspects of his life. "My Dog Skip" was released on March 3, 2000, by Warner Bros., receiving generally positive reviews from critics. The film earned $35,547,761 on a $4.5 million budget.', 'title': 'My Dog Skip (film)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'William Weaks "Willie" Morris (November 29, 1934 – August 2, 1999), was an American writer and editor born in Jackson, Mississippi, though his family later moved to Yazoo City, Mississippi, which he immortalized in his works of prose. Morris\' trademark was his lyrical prose style and reflections on the American South, particularly the Mississippi Delta. In 1967 he became the youngest editor of "Harper\'s Magazine". He wrote several works of fiction and non-fiction, including his seminal book "North Toward Home", as well as "My Dog Skip".', 'title': 'Willie Morris'}
