 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'War Eagle, Arkansas is a feature film based on two real-life friends, Tim Ballany and Vincent Insalaco III, growing up together in Arkansas and facing a crossroads in life as they graduate from high school. The character of "Wheels" is portrayed by New York actor Dan McCabe, who convincingly recreates Ballany\'s Cerebral Palsy. The best friend role of "Enoch" is portrayed by Luke Grimes, as a troubled teen who excels at baseball but struggles with stuttering and confidence problems. Other stars in the film include Brian Dennehy, Mary Kay Place, Mare Winningham and James McDaniel. The film was shot entirely in Northwest Arkansas, primarily in Eureka Springs, Huntsville, and Fayetteville, and has won over 20 independent film festival awards, including Best Picture and Best Actor at major festivals such as the Breckenridge Film Festival, the Hollywood Film Festival, and California Independent Film Festival. The film\'s budget was a modest $1.1 million, and was provided by Executive Producer Vincent Insalaco, Sr. and a group of private investors. Of additional benefit to the film was a grant from Panavision, under a new filmmaker\'s program, which was based in large part on the screenplay by Graham Gordy, whose other film credits include The Love Guru and My Dog Skip. War Eagle, Arkansas was released in the U.S. by Empire Film Group on June 12, 2009.', 'title': 'War Eagle, Arkansas (film)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Middle Lake Trail is in the northwestern Sawatch Range, part of the Rocky Mountains in the U.S. state of Colorado. It is located in the Holy Cross Wilderness northeast of New York Mountain in Eagle County. Middle Lake Trail is south of Interstate 70, near Eagle and Edwards. Middle Lake Trail is accessible by hiking south along the Dead Dog Trail from West Lake Creek Road south of Edwards. Dead Dog Trail crosses a ridge and ascends to a junction with the Middle Lake Trail that is 3.3 miles from Dead Dog trailhead, at 11,250 feet. Middle Lake Trail continues east to the top of the ridge, at 11,770 feet, overlooking East Lake Creek Valley. Then, Middle Lake Trail drops off the ridge to Middle Lake. Hiking Colorado: Holy Cross Wilderness, a hiking guide by Kim Fenske, provides a description of Middle Lake Trail access from Dead Dog Trail.', 'title': 'Middle Lake Trail'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Rescue 8 is a syndicated American action drama series about Los Angeles County Fire Department Rescue Squad 8. It premiered in 1958 and originally ran for two seasons with syndicated reruns continuing for almost a decade thereafter. It starred Jim Davis as fireman Wes Cameron (much later cast as Jock Ewing on CBS\'s "Dallas"), and Lang Jeffries as the fireman Skip Johnson. Nancy Rennick and Mary K. Cleary each appeared in twenty-four episodes as Patty Johnson and Susan Johnson, the wife and daughter, respectively of Skip Johnson. The series was produced by Screen Gems, with directors Dann Cahn and William Witney. "Rescue 8" produced seventy-four half-hour episodes. The first season ran on Tuesday evenings, and the second season on Wednesdays.', 'title': 'Rescue 8'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Hideo Kanaya (Shinjitai: 金谷 秀夫 , Hideo Kanaya , February 3, 1945 – December 19, 2013) was a Grand Prix motorcycle road racer from Japan. Kanaya began his Grand Prix career in 1967 and won his first Grand Prix at the 1972 250cc German Grand Prix. In 1972, Kanaya and Jarno Saarinen raced the first four-cylinder, two-stroke Yamaha TZ 500 in the 500cc world championship. After Saarinen's death in the 250cc race at the Italian Grand Prix at Monza, the TZ 500 project was put aside and Kanaya raced only in the 250cc class. Kanaya's best season was in 1975, when he finished third in the 500cc world championship behind his Yamaha team-mate, Giacomo Agostini and MV Agusta's Phil Read. He also won the Macau Grand Prix in 1975.", 'title': 'Hideo Kanaya'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 2013 German Grand Prix (formally known as the Formula 1 Großer Preis Santander von Deutschland 2013) was a Formula One motor race that was held on 7 July 2013 at the Nürburgring in Nürburg, Germany. The race was the ninth round of the 2013 season, and marked the 74th running of the German Grand Prix overall, and the 60th running of the German Grand Prix since 1950, when the racing series now known as the Formula One World Championship was created. This is the earliest a German Grand Prix has been held in a calendar year, followed by the 1926 and the 2009 editions of the race.', 'title': '2013 German Grand Prix'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Börje Jansson (born November 10, 1942 ) was a former Grand Prix motorcycle road racer from Sweden. His best years were in 1971 and 1972, when he finished third in the 125cc world championship riding for the Maico factory racing team. He won the 1972 125cc East German Grand Prix, marking the first Grand Prix road racing victory for the German motorcycle manufacturer. Jansson won four Grand Prix races in his career. Jansson is the only rider in history to win a Grand Prix riding the Derbi 250 twin (1972 Austrian Grand Prix at the Salzburgring), out of only two races with the Spanish machine.', 'title': 'Börje Jansson'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'John Surtees, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (11 February 1934 – 10 March 2017) was an English Grand Prix motorcycle road racer and Formula One driver. He was a four-time 500cc motorcycle World Champion – winning that title in 1956, 1958, 1959 and 1960 – the Formula One World Champion in 1964, and remains the only person to have won World Championships on both two and four wheels. He founded the Surtees Racing Organisation team that competed as a constructor in Formula One, Formula 2 and Formula 5000 from 1970 to 1978. He was also the ambassador of the Racing Steps Foundation.', 'title': 'John Surtees'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The 1959 German Grand Prix was a Formula One motor race held at the Automobil-Verkehrs- und Übungs-Straße in West Berlin on 2 August 1959. It was race 6 of 9 in the 1959 World Championship of Drivers and race 5 of 8 in the 1959 International Cup for Formula One Manufacturers. It was the 21st German Grand Prix and was only the second time the race was not held at the Nürburgring. AVUS had previously held the original German Grand Prix in 1926. The race was held over two 30 lap heats of the eight kilometre circuit for a total race distance of 498 kilometres.', 'title': '1959 German Grand Prix'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The 1974 German Grand Prix was a Formula One motor race held at the Nürburgring on 4 August 1974. It was race 11 of 15 in both the 1974 World Championship of Drivers and the 1974 International Cup for Formula One Manufacturers. It was the 36th German Grand Prix and the 33rd to be held at the Nürburgring complex of circuits. The race was won by Swiss driver Clay Regazzoni driving a Ferrari 312B3. Regazzoni led every lap on the way to his second Grand Prix victory, some four years after his debut victory at the 1970 Italian Grand Prix. South African driver Jody Scheckter was second driving a Tyrrell 007 ahead of Argentine driver Carlos Reutemann (Brabham BT44).', 'title': '1974 German Grand Prix'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The 1962 German Grand Prix was a Formula One motor race held at the Nürburgring on 5 August 1962. It was race 6 of 9 in both the 1962 World Championship of Drivers and the 1962 International Cup for Formula One Manufacturers. The 15-lap race was won by BRM driver Graham Hill after he started from second position. John Surtees finished second for the Lola team and Porsche driver Dan Gurney came in third. The race was notable for having six different constructors taking the first six positions.', 'title': '1962 German Grand Prix'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Brabham BT3 is a Formula One racing car. It was the first Formula One design to be produced by Motor Racing Developments for the Brabham Racing Organisation, and debuted at the 1962 German Grand Prix. The Brabham BT3 was the vehicle with which team owner – then two-time World Champion – Jack Brabham, became the first driver ever to score World Championship points in a car bearing his own name, at the 1962 United States Grand Prix. The following year Brabham also became the first driver ever to win a Formula One race at the wheel of an eponymous car, again driving the BT3, at the 1963 Solitude Grand Prix. The BT3 design was modified only slightly to form the Tasman Series-specification Brabham BT4 cars.', 'title': 'Brabham BT3'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Klenk-Meteor was a racing car which competed in the 1954 German Grand Prix. The car was based on the established German marque of Veritas which was active between 1948 and 1953. Veritas is chiefly remembered as a manufacturer of sports cars and successful Formula Two racing cars. The company closed when its founder, Ernst Loof, became ill. He subsequently died in 1956. The Klenk-Meteor entered for the 1954 German Grand Prix was essentially a Veritas Formula Two car. The car was owned and prepared by the noted German racing driver Hans Klenk who intended to race it himself in the Grand Prix. However, Klenk's career as a racing driver came to an end when he suffered injuries in an accident while working as a test driver for Mercedes-Benz. The car was driven in the Grand Prix by another German, Theo Helfrich. He retired on lap 9 with engine failure.", 'title': 'Klenk'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Wilco Zeelenberg (born 19 August 1966) is a Dutch former professional Grand Prix motorcycle road racer and current race team manager. Born in Bleiswijk, he began racing motorcycles in motocross competitions before switching to road racing. Zeelenberg made his Grand Prix debut in the 80cc class in 1986. He won his first and only world championship race at the 1990 250cc German Grand Prix. His best season was in 1991, when he finished the season ranked fourth in the 250cc world championship riding a Honda.', 'title': 'Wilco Zeelenberg'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The 6th Asian Games were held from December 9, 1970, to December 20, 1970, in Bangkok, Thailand. Originally Seoul, South Korea was selected to host the 6th Games but it declined due to both financial reasons and security threats from neighboring North Korea but eventually the city finally hosted in 1986. Previous host Thailand stepped in to save the Asiad and staged the Games using the funds of South Korea. A total number of 2,400 athletes, coming from 18 countries, competed in this Asiad, where yachting made its debut.', 'title': '1970 Asian Games'}
