 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Chandgi Ram (9 November 1937 – 29 June 2010), often referred to as Master Chandgi Ram, was a freestyle wrestler from India. He won gold medal in the 1970 Asian Games and represented India in the 1972 Summer Olympics. Along with amateur wrestling, he was very active in the traditional Indian wrestling, where he had won all major titles, including Hind Kesari, "Bharat Kesari", "Bharat Bhim", "Rustom-e-Hind" and "Maha Bharat Kesari".', 'title': 'Chandgi Ram'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The 1963 Pan American Games, officially known as the IV Pan American Games, was a continental multi-sport event held in São Paulo, Brazil, from April\xa020 to May\xa05, 1963. At the Games, 1,665 athletes selected from 22 National Olympic Committees (NOCs) participated in events in 19 sports. Eighteen nations earned medals during the competition and eleven won at least one gold. Barbados, debuting at the Pan American Games, won its first medals (three bronze), while British Guiana won its first ever gold medal. Colombia, Costa Rica, the Dominican Republic, Haiti, Nicaragua and Paraguay did not send athletes to São Paulo, making it the Games with the lowest number of competitors in history.', 'title': '1963 Pan American Games medal table'}
