[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Pete's Dragon is a 2016 American fantasy comedy-drama adventure film directed by David Lowery, written by Lowery and Toby Halbrooks, and produced by James Whitaker. The film is a reboot of the 1977 musical film of the same name written by Malcolm Marmorstein. The film stars Bryce Dallas Howard, Oakes Fegley, Wes Bentley, Karl Urban, Oona Laurence, and Robert Redford. The film tells the story of an orphaned feral boy who befriends a dragon in the Pacific Northwest, and the ensuing repercussions of their discovery by the town's local residents.", 'title': "Pete's Dragon (2016 film)"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Dragon Ball Z: Dead Zone, originally released theatrically in Japan as simply Dragon Ball Z and later as Dragon Ball Z: Return My Gohan!! (Japanese: ドラゴンボールZ オラの悟飯をかえせッ!! , Hepburn: Doragon Bōru Zetto Ora no Gohan o Kaese!! ) for its Japanese VHS and Laserdisc release, is the fourth anime film in the "Dragon Ball" franchise and the first one under the "Dragon Ball Z" moniker. It was originally released in Japan on July 15, 1989 at the "Toei Manga Matsuri" film festival along with the 1989 film version of "Himitsu no Akko-chan", the first "Akuma-kun" movie, and the film version of "Kidou Keiji Jiban".', 'title': 'Dragon Ball Z: Dead Zone'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ashes and Light is an album by Mark Heard, released in 1984 on Home Sweet Home Records. According to the liner notes, Heard recorded Mosaics first, but the record company wanted this album released first.', 'title': 'Ashes and Light'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Dragon Ball: The Path to Power (Japanese: ドラゴンボール 最強への道 , Hepburn: Doragon Bōru Saikyō e no Michi ) , is the seventeenth Japanese animated feature film based on Akira Toriyama\'s "Dragon Ball" manga, following the first three "Dragon Ball" films and thirteen "Dragon Ball Z" films. It is a re-telling of the original "Dragon Ball" anime series, mixing the elements from the first Dragon Ball search and the later Red Ribbon storyline. It was originally released in Japan on March 2, 1996 at the Toei Anime Fair, along with the movie version of "Neighborhood Story". The film was produced to commemorate the tenth anniversary of the original "Dragon Ball" anime. It was also the last theatrically released Dragon Ball movie produced up until the release of "" in 2013.', 'title': 'Dragon Ball: The Path to Power'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Dragon Ball Z: Battle of Gods (Japanese: ドラゴンボールZ 神と神 , Hepburn: Doragon Bōru Zetto: Kami to Kami , lit. "Dragon Ball Z: God and God") is the eighteenth Japanese animated feature film based on the "Dragon Ball" series and the fourteenth to carry the "Dragon Ball Z" branding, released in theaters on March 30, 2013. It is the first "Dragon Ball" movie in 17 years to have a theatrical release, the last being in 1996, which followed the first three "Dragon Ball" films and the thirteen "Dragon Ball Z" films. Unlike previous theatrical "Dragon Ball" releases, this was a full feature-length production with a stand-alone release and not shown as part of the now-discontinued Toei Anime Fair (formerly the Toei Manga Matsuri).', 'title': 'Dragon Ball Z: Battle of Gods'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Home on the Range is a 2004 American animated musical western comedy film produced by Walt Disney Feature Animation and released by Walt Disney Pictures. The 45th Disney animated feature film, it was the last 2D animated Disney film released until "The Princess and the Frog" in 2009. Named after the popular country song of the same name, "Home on the Range" features the voices of Roseanne Barr, Judi Dench, Jennifer Tilly, Cuba Gooding Jr., Randy Quaid, and Steve Buscemi. The film is set in the Old West, and centers on a mismatched trio of dairy cows—brash, adventurous Maggie; prim, proper Mrs. Caloway; and ditzy, happy-go-lucky Grace. The three cows must capture an infamous cattle rustler named Alameda Slim for his bounty in order to save their idyllic farm from foreclosure. Aiding them in their quest is Lucky Jack, a feisty, peg-legged rabbit, but a selfish horse named Buck, eagerly working in the service of Rico, a famous bounty hunter, seeks the glory for himself.', 'title': 'Home on the Range (2004 film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Walt Disney Classics was a brand name used by Walt Disney Home Video on their American, Japanese, European, and Australian home video releases of List of Walt Disney Animation Studios features. The last title in the Classics line from 1984–1994 was "The Fox and the Hound". With the release of "Snow White and the Seven Dwarfs", all the existing titles in the Classics line were replaced with the Masterpiece Collection line and the Classics line was canceled in the United States and Canada. Cassette copies of the original Classics series became much sought-after, and are very popular with collectors, since most retailers had the first home video release for Disney animated features in their stores up to the time when the label was discontinued. Animated features and other films containing animation (such as "Mary Poppins" and "Pete\'s Dragon") continued to be released under the "Walt Disney Classics" label and its foreign language equivalents until around 2007 throughout Europe, and "Walt Disney Meisterwerke", the German equivalent series, is still in operation as of 2010 through its broader "Special Collection" range.', 'title': 'Walt Disney Classics'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Midnite Movies is a line of B movies released first on VHS and later on DVD by MGM Home Entertainment. The line was begun by MGM in March 2001 following its acquisition of Orion Pictures, which bought out Filmways, the owner of American International Pictures. AIP had a library of B movies from the 1950s and 1960s that were science fiction, horror, and exploitation films. The "Midnite Movies" collection is primarily derived from the AIP library (including most of Roger Corman\'s and Vincent Price\'s horror movies) but also included Hammer Film Productions, Amicus Productions, United Artists, and Empire International Pictures movies as well. The DVDs were first released as single films but most later releases would be double features on single double-sided discs. Sony Pictures Home Entertainment later became owners of the MGM library and continued the "Midnite Movies" line with distributor 20th Century Fox Home Entertainment. All double feature titles released on the 20th Century Fox label were two-disc packages. By 2011, no new titles were forthcoming; the previous catalog titles slowly went out of print and the "Midnite Movies" website was taken down.', 'title': 'Midnite Movies'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Mosaics is an album by Mark Heard, released in 1985 on Home Sweet Home Records. According to the liner notes in "Ashes and Light", this album was recorded first but delayed by the record company who wanted the less rock-oriented "Ashes" released first. Consequently, this was the first album recorded in Heard\'s own Fingerprint Recording Studio.', 'title': 'Mosaics (album)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Dragon Ball: Curse of the Blood Rubies, known in Japan as Dragon Ball during its initial theatrical release and later retitled Dragon Ball: Shenron no Densetsu (ドラゴンボール 神龍の伝説 , Doragon Bōru Shenron no Densetsu , lit. "Dragon Ball: The Legend of Shenlong") for its home video release, is the first in a series of feature films in the "Dragon Ball" anime franchise, based on the manga of the same name by Akira Toriyama. The film is a modified adaptation of the initial story arc in the manga, with the original character King Gurumes substituting Emperor Pilaf\'s role as the main antagonist. Like in the manga, it depicts how Goku meets up with Bulma, as well as Oolong, Yamcha, Puar and finally Master Roshi during his first search for the Dragon Balls.', 'title': 'Dragon Ball: Curse of the Blood Rubies'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Ramzan Akhmadovich Kadyrov (Russian: Рамза́н Ахма́тович Кады́ров ; ] , Chechen: Къадар Ахьмат-кIант Рамзан, "Q̇adar Aẋmat-khant Ramzan" ; born 5 October 1976) is the Head of the Chechen Republic and a former member of the Chechen independence movement.', 'title': 'Ramzan Kadyrov'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Magomedrasul Saidpashievich Gadzhiev (Russian: Магомедмурад Саидпашаевич Гаджиев ; born February 15, 1988 in Dagestan) is a Russian Naturalized Polish freestyle wrestler of Dargin heritage. International Master of Sports in Freestyle Wrestling. He is bronze medalist of 2010 Russian Freestyle Wrestling Nationals. At 2015 World Wrestling Championships in the second round he lost to World Champion Frank Chamizo (3-4) European Games 2015 ruuner-up, who competed in the men's freestyle 70\xa0kg category at the 2015 European Games and won the silver medal. Golden Grand prix Ivan Yarygin 2010 champion, bronze medalist in 2009 and 2011, European Championships 2010 runner-up, Ramzan Kadyrov Cup 3rd 2010 and World Cup 2011 winner. Gadzhiev competed at Olympics 2016, but he lost to Frank Molinaro in the qualifications.", 'title': 'Magomedmurad Gadzhiev'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Sulim Bekmirzayevich Yamadayev (Russian: Сули́м Бекмирза́евич Ямада́ев ; 21 June 1973 – 30 March 2009) was a Chechen rebel commander from the First Chechen War who had switched sides together with his brothers Dzhabrail, Badrudi, Isa and Ruslan in 1999 during the outbreak of the Second Chechen War. He was "de facto" commander of the Russian military Special Battalion Vostok unit belonging to the GRU. As such, until 2008, he was officially in command of the biggest pro-Moscow militia outside the control of the current Chechen president Ramzan Kadyrov. From 1 to 22 August August 2008 Yamadayev was wanted in Russia on a federal warrant. Nevertheless, he served as one of the Russian military commanders in Russia\'s war with Georgia during the same period.', 'title': 'Sulim Yamadayev'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Kadyrovtsy (Russian: Кадыровцы, "Kadyrovcy" , literally "Kadyrov\'s followers"), also Kadyrovites, is a term used by the population of Chechnya, as well as members of the groups themselves, for former members of the paramilitary units of the former pro-Russian President of the Chechen Republic Akhmad Kadyrov, headed by his son and the current President Ramzan Kadyrov.', 'title': 'Kadyrovtsy'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The 2010 Tsentoroy Attack was an insurgent operation carried out on the morning of 29 August 2010 by Chechen rebels in Tsentoroy (also known as Khosi-Yurt), Chechnya, the home village and stronghold of pro-Moscow Chechen President Ramzan Kadyrov. The assault - which represented the largest and most audacious attack launched in the republic for over a year - is considered to have "shattered" the image of Kadyrov\'s unshakeable rule in Chechnya, as it was the first time in six years that his seemingly impregnable village had come under attack.', 'title': '2010 Tsentoroy attack'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Zamira Dzhabrailova (born 1991) is the first winner of a controversial beauty contest in Chechnya. Dzhabrailova, a 15-year-old schoolgirl, won the "Beauty of Chechnya 2006" contest organised by Ramzan Kadyrov in Grozny on May 27, 2006.', 'title': 'Zamira Dzhabrailova'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Umar S. Israilov (c. 1982 – January 13, 2009) was a former bodyguard of Chechen President Ramzan Kadyrov who became a critic of the Chechen regime. He was shot and killed in exile in Vienna, Austria on January 13, 2009.', 'title': 'Umar Israilov'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Akhmat-Arena (Russian: «Ахмат-Арена» ) is a multi-use stadium in Grozny, Russia, named after former President of the Chechen Republic Akhmad Kadyrov. It was completed in May 2011, and is used mostly for football matches. The stadium hosts home matches of FC Terek Grozny. The stadium was designed with a capacity of 30,000 spectators. It replaced Sultan Bilimkhanov Stadium as the home of FC Terek. The grand opening took place on May 11, 2011 and featured a match between the team of Caucasus against the team of World stars. Team Caucasus featured the likes of Alexander Khloponin, Ramzan Kadyrov, Rinat Dasayev, Timur Dzhabrailov, Andrei Fedkov and others. Team World featured Diego Maradona, Luís Figo, Roberto Ayala, Franco Baresi, Alain Boghossian and others. Team Caucasus won the game 5 goals to 2.', 'title': 'Akhmat-Arena'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Sulim Yamadaev–Ramzan Kadyrov power struggle was a feud between rival pro-Moscow Chechen warlords that exploded into armed confrontation between Yamadaev’s Special Battalion “Vostok” (East) forces and Chechen President Kadyrov’s militia known as the “Kadyrovtsy” following an incident in the town of Argun that led to a shootout in Gudermes on 14 April 2008. The struggle resulted in the eventual disbanding of the Vostok battalion and Yamadaev’s assassination in Dubai on 30 March 2009.', 'title': 'Sulim Yamadaev–Ramzan Kadyrov power struggle'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Albert Ramazanovich Saritov (Russian: Альберт Рамазанович Саритов ; born July 8, 1985 in Khasavyurt) is a Russian Naturalized Romanian freestyle wrestler of Chechen descent. 2016 Olympics bronze medalist, bronze medalist World Wrestling Championships 2011 in Istanbul, Turkey. Ramzan Kadyrov & Adlan Varayev cup 2012 winner, Golden Grand Prix Ivan Yarygin 2011 runner-up and winner Ali Aliyev Memorial 2014. He representing for Mindiashvili wrestling academy.', 'title': 'Albert Saritov'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Lycée Français de Palma (LFP; Spanish: Liceo francés de Palma ) is a French international school in El Terreno (/), Palma de Mallorca, Spain. It serves "toute petite section" through "lycée" (senior high school/sixth form college).', 'title': 'Lycée Français de Palma'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Daniel Michael DeVito, Jr. (born November 17, 1944) is an American actor, comedian, director and producer. He gained prominence for his portrayal of the taxi dispatcher Louie De Palma in the television series "Taxi" (1978–1983), which won him a Golden Globe and an Emmy.', 'title': 'Danny DeVito'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Palma Nova Beach is seven kilometers (4.3\xa0mi) from Calvià, situated between Punta Nadala and es Carregador, on the Spanish Balearic island of Majorca. Besides Palmanova beach, other names by which the beach is known include "Playa de Palma Nova", and "Platja de Palma Nova". The Palma Nova sea front has three beaches: Torrenova, Es Carregador, and Palma Nova. The beach has had an extension of 500 m and has needed an artificial regeneration to achieve the current aspect of fine and white sand, as well as its dimensions.', 'title': 'Palmanova beach'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Mission: Impossible is a 1996 American action spy film directed by Brian De Palma, produced by and starring Tom Cruise. Based on the , the plot follows Ethan Hunt (Cruise) and his mission to uncover the mole who has framed him for the murders of his entire Impossible Missions Force (IMF) team. Work on the script had begun early with filmmaker Sydney Pollack on board, before De Palma, Steven Zaillian, David Koepp, and Robert Towne were brought in. "Mission: Impossible" went into pre-production without a shooting script. De Palma came up with some action sequences, but Koepp and Towne were dissatisfied with the story that led up to those events.', 'title': 'Mission: Impossible (film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Wise Guys is a 1986 black Mafia comedy crime film directed by Brian De Palma and starring Danny DeVito and Joe Piscopo. A comedy revolving around two small-time mobsters from Newark, New Jersey, it also features Harvey Keitel, Ray Sharkey, Lou Albano, Dan Hedaya, and Frank Vincent.', 'title': 'Wise Guys (1986 film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Duchess of Palma de Mallorca (Catalan: "Ducat de Palma de Mallorca" , Spanish: "Duquesa de Palma de Mallorca" ) was a noble title granted for life by King Juan Carlos I of Spain to his daughter, The Infanta Cristina, on 26 September 1997 on the occasion of her forthcoming marriage to Iñaki Urdangarin. Cristina was stripped of her Dukedom by King Felipe VI, her younger brother, on 11 June 2015, due to a corruption inquiry, and the Dukedom was merged again in the Spanish Crown.', 'title': 'Duchess of Palma de Mallorca'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Bay of Palma (Catalan: "Badia de Palma" , Spanish: "Bahía de Palma" ) is a bay located to the south of Palma, Majorca, Spain. It is in the south-west of the Balearic Island of Mallorca. Palma de Majorca\'s harbour is located on the northern shores along with some famous beaches. It is bounded to the west by Cape Cala Figuera, to the north by the city of Palma, to the south by the Mediterranean Sea and to the east by the White Cape. The Serra de Na Burguesa terminates at its shore.', 'title': 'Bay of Palma'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Palma de Mallorca Airport (Catalan: "Aeroport de Palma de Mallorca" , Spanish: "Aeropuerto de Palma de Mallorca" ; IATA: PMI,\xa0ICAO: LEPA ) is an international airport located 8 km east of Palma, Majorca, Spain, adjacent to the village of Can Pastilla. Also known as "Son Sant Joan Airport" or "Aeroport de Son Sant Joan", it is the third largest airport in Spain, after Madrid–Barajas and Barcelona. During the summer months it is one of the busiest airports in Europe, and was used by 26.2 million passengers in 2016. The airport is the main base for the Spanish carrier Air Europa and also a focus airport for Ryanair, EasyJet and Vueling.', 'title': 'Palma de Mallorca Airport'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Palma Metro (Catalan: "Metro de Palma" , Spanish: "Metro de Palma" ["de Mallorca"] ) is a light metro system in Palma, Majorca, Spain. The initial line of the system, M1, consists of 7.2 km of route and nine stations, and was constructed between 2005 and 2007 at cost of 312 million euros; it opened for service on 25 April 2007. In March 2013, an existing 8.35 km and nine station rail line was bundled in to the metro\'s service as the system\'s M2 line.', 'title': 'Palma Metro'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Lewis Allen (25 December 1905 – 3 May 2000) was an English director. Allen worked mainly in the United States, working on Broadway and directing 18 feature films between 1944 and 1959. From the mid-1950s he moved increasingly into television and worked on a number of the most popular shows of the time in the US.', 'title': 'Lewis Allen (director)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Hunt with John Walsh is an investigation/documentary series that debuted on CNN on July 13, 2014. The series is hosted by John Walsh. The second season premiered on July 12, 2015, and the third season premiered on June 19, 2016. The fourth season premiered on CNN's sister station, HLN, on July 23, 2017.", 'title': 'The Hunt with John Walsh'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'This is a list of episodes from the anime series "Mobile Suit Gundam 00". The series premiered on October 6, 2007, replacing Toward the Terra on the terrestrial MBS and TBS networks, occupying the networks\' noted Saturday 6:00\xa0p.m. timeslot. The first season ended its run on March 29, 2008. Season one of the series has been re-broadcast across Japan on various television networks such as TBS, Kids Station, MBS and BS-i from April onwards. Season two is being broadcast in the MBS and TBS Sunday 5:00\xa0p.m. slot since October 5, 2008. The second season ended its run on March 29, 2009. Season two of the series has been re-broadcast across Japan on various television networks such as TBS, Kids Station, MBS and BS-i from April onwards. The English dub of the first season premiered on Syfy (spelled Sci Fi at the time; renamed Syfy during 2000s run on the network) on Monday November 24, 2008 at 11:00\xa0p.m. and ended on February 9, 2009. The English dub of the second season premiered on Syfy on Monday June 29, 2009 at 11:00\xa0p.m. and concluded on September 21, 2009.', 'title': 'List of Mobile Suit Gundam 00 episodes'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Little Women: Atlanta (often abbreviated to Little Women: ATL) is an American reality television series that debuted on January 27, 2016, on Lifetime. It is the spin-off series of . The series chronicles the lives of little women who are friends living in Atlanta, Georgia. The second season premiered on July 13, 2016. The third season premiered on January 4, 2017 with two new main cast members, Samantha Ortiz and Tanya Scott who replaced Emily Fernandez and Bri Barlup who moved to Dallas, and are currently starring in ""', 'title': 'Little Women: Atlanta'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Hemlock Grove" is an American supernatural drama series developed by Brian McGreevy and Lee Shipman, based on McGreevy\'s novel of the same name. The first season premiered exclusively via Netflix\'s web streaming service on April 19, 2013. The second season premiered on July 11, 2014. The third and final 10-episode season premiered on October 23, 2015.', 'title': 'List of Hemlock Grove episodes'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Into the Badlands is an American television series that premiered on AMC November 15, 2015. The series features a story about a warrior and a young boy who journey through a dangerous feudal land together seeking enlightenment. AMC renewed the show for a 10-episode second season, which premiered on March 19, 2017. On April 25, 2017, AMC renewed the series for a 16-episode third season.', 'title': 'Into the Badlands (TV series)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Emily Beecham is an English-American actress. She is best known for her role in the AMC television series "Into the Badlands". In 2011, she received the Best Actress award at the London Independent Film Festival.', 'title': 'Emily Beecham'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Undercover Boss" is an American 2010 reality television series, based on the British series of the same name. The first episode of the first season premiered on February 7, 2010, after Super Bowl XLIV, and featured Bob O\'Donnell, President and Chief Operating Officer of Waste Management, Inc. On March 9, 2010, CBS announced it had renewed "Undercover Boss" for a second season. On July 28, 2010, CBS announced four company executives had signed up for the second season of "Undercover Boss", the executives are from NASCAR, DirecTV, Chiquita Brands International and Great Wolf Lodge, Inc. The Choice Hotels CEO, Steve Joyce, was the first boss for the second season of the show on September 26, 2010. On March 27, 2011, CBS officially renewed "Undercover Boss" for a third season. On May 18, 2011, CBS then announced that it would be holding the show for a mid-season replacement to premiere Sunday January 15, 2012, with an undetermined amount of episodes. The third season premiered on January 15, 2012. The fourth season premiered on November 2, 2012. The fifth season premiered on September 27, 2013. The sixth season premiered on December 14, 2014. The eighth season premiered on December 21, 2016.', 'title': 'List of Undercover Boss (U.S. TV series) episodes'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'This is a list of episodes for the stop-motion television series "Robot Chicken". The first episode of "Robot Chicken" aired on February 20, 2005 at 11:30 PM EST on Adult Swim and the first season finished on July 18, 2005. The second season began on April 2, 2006 and ended on November 19, 2006. The show\'s third season premiered on August 12, 2007 and ended on October 5, 2008. The fourth season premiered on December 7, 2008 and ended on December 6, 2009. The series was put on hiatus after the fourth-season finale on December 6, 2009, and resumed with the fifth season on December 12, 2010, which ended on January 15, 2012. The sixth season premiered on September 16, 2012 and included a half-hour special based on DC Comics.', 'title': 'List of Robot Chicken episodes'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Are You the One? " is a United States reality television series on MTV. It follows 20 people who are living together to find their perfect match. If all 20 singles are able to match up with their predetermined partners within 10 attempts, they share the largest cash prize ever awarded by an MTV show and walk away with a potential partner for life. The first season was filmed in Hawaii and premiered January 21, 2014. The second season premiered October 6, 2014. The third season premiered September 25, 2015 and was filmed in Puerto Rico. The fourth season premiered June 13, 2016 and was filmed in Hawaii. The fifth season premiered on January 11, 2017 and was filmed in Cabarete, Dominican Republic. The sixth season will premiere on September 20, 2017 and was filmed in New Orleans, Louisiana.', 'title': 'List of Are You the One? episodes'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Gypsy Sisters was an American reality television series on TLC. The series debuted on February 10, 2013. It follows the daily life of Romanichal women located in Martinsburg, West Virginia. The series serves as a spin-off to its sister show "My Big Fat American Gypsy Wedding". The second season premiered on December 5, 2013. The third season premiered August 21, 2014. The fourth season premiered on May 31, 2015. TLC officially cancelled the series on July 30, 2015 due to low ratings.', 'title': 'Gypsy Sisters'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Mornington Peninsula Regional Gallery is a public art gallery on the Mornington Peninsula, south-east of Melbourne, Australia. The gallery opened in 1971, and holds both traditional and contemporary Australian art. In 2013 the gallery hosted an exhibition of Archibald Prize paintings, setting a gallery attendance record of 48,000. The gallery is host to the National Works on Paper acquisitive art competition, established in 1998. Artists whose work is held by the Mornington Peninsula Regional Gallery include Constance Stokes.', 'title': 'Mornington Peninsula Regional Gallery'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Merricks Beach is a small seaside village on the Mornington Peninsula Victoria, Australia. It is located on the eastern side of the peninsula on Western Port Bay. It is one of the few coastal places within a 100\xa0km radius of Melbourne that has been basically untouched by development. Its local government area is the Shire of Mornington Peninsula.', 'title': 'Merricks Beach, Victoria'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Mornington Peninsula is a peninsula located south-east of Melbourne, Australia. It is surrounded by Port Phillip to the west, Western Port to the east and Bass Strait to the south, and is connected to the mainland in the north. Geographically, the peninsula begins its protrusion from the mainland in the area between Pearcedale and Frankston. The area was originally home to the "Mayone-bulluk" and "Boonwurrung-Balluk" clans and formed part of the Boonwurrung nation\'s territory prior to European settlement.', 'title': 'Mornington Peninsula'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Balnarring is a town in Victoria, Australia, in the southeastern Mornington Peninsula about halfway between Hastings and Flinders. Its local government area is the Shire of Mornington Peninsula.', 'title': 'Balnarring, Victoria'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The Shire of Flinders was a local government area, encompassing the extremity of the Mornington Peninsula, about 65 km south of Melbourne, the state capital of Victoria, Australia. The shire covered an area of 324 km2 , and existed from 1874 until 1994.', 'title': 'Shire of Flinders (Victoria)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Flinders once known as Mendi-Moke, is a town south of Melbourne, Victoria, Australia, located on the Mornington Peninsula at the point where Western Port meets Bass Strait. Its local government area is the Shire of Mornington Peninsula. At the 2011 census, Flinders had a population of 860.', 'title': 'Flinders, Victoria'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Somers is a small town approximately 72\xa0km south-east of Melbourne, Victoria, Australia, in the south-eastern corner of the Mornington Peninsula on Western Port. Its local government area is the Shire of Mornington Peninsula.', 'title': 'Somers, Victoria'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Mornington is a seaside town on the Mornington Peninsula, Victoria, Australia, located 57 km south of Melbourne's central business district. It is in the local government area of the Shire of Mornington Peninsula.", 'title': 'Mornington, Victoria'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Shire of Mornington was a local government area about 50 km south of Melbourne, the state capital of Victoria, Australia, encompassing the western extremity of the Mornington Peninsula. The shire covered an area of 90.65 km2 immediately to the south of Frankston, and existed from 1960 until 1994.', 'title': 'Shire of Mornington (Victoria)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Merricks is a small town in Victoria, Australia in the southeastern Mornington Peninsula between Hastings and Flinders. Its local government area is the Shire of Mornington Peninsula.', 'title': 'Merricks, Victoria'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'John Edward Hetki (born May 12, 1922) is a former long relief pitcher in Major League Baseball who played for the Cincinnati Reds, St. Louis Browns and Pittsburgh Pirates in all or parts of eight seasons spanning 1945–54. Listed at 6 ft , 202 lb , Hetki batted and threw right-handed. He was born in Leavenworth, Kansas.', 'title': 'Johnny Hetki'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Matumona Lundala known most simply as Goliath (born August 1, 1972 in Esperança) is an Angolan goalkeeper who won the 2005 Angolan Cup with Sagrada Esperança. He is measured at 1.81\xa0m (5\xa0ft 11 in) and 92\xa0kg (202\xa0lb or 14 st 4 lb ). He was also a member of the Angolan squad at the African Cup of Nations in 2006 acting as experienced back-up for first-choice shotstopper João Ricardo.', 'title': 'Matumona Lundala'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Enid Lake is a lake that is located mostly in Yalobusha County in the U.S. state of Mississippi. Parts of it extend into Panola and Lafayette counties. Common fish species include crappie, largemouth bass, catfish and bream. Enid Lake holds world records for white crappie 5.3 lb and shortnose gar 5.83 lb .', 'title': 'Enid Lake'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Slab Fork is an unincorporated community in Raleigh County, West Virginia, United States with a population of 202. Slab Fork is located along a stream of the same name and West Virginia Route 54. The ZIP code for Slab Fork is 25920.', 'title': 'Slab Fork, West Virginia'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Witthoefft House is a historic home located at Armonk, Westchester County, New York. It was built in 1957, and is a one-story, Modernist style dwelling on a concrete slab foundation and stone covered concrete retaining walls. It features exposed structural steel, white glazed-brick walls, and full elevations of glass. The house is perched atop rock outcroppings in a semi-rural setting.', 'title': 'Witthoefft House'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'A ship carrying plutonium collides with a floating atoll off the eastern coast of the Philippines, one of many incidents occurring throughout the area. As the anomalous formation approaches Japan, a team of scientists led by Naoya Kusanagi (Akira Onodera) discover orihalcum amulets and a stone slab covered in Etrurian runes on the atoll. During the investigation, the atoll suddenly quakes, destroying the slab and throwing the scientists into the ocean. One member of the team, Marine Officer Yoshinari Yonemori (Tsuyoshi Ihara), sees the eye and tusk of a giant turtle.', 'title': 'Gamera: Guardian of the Universe'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The Kensington Runestone is a 202 lb slab of greywacke covered in runes on its face and side.', 'title': 'Kensington Runestone'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Bridge Number 3355 in Kathio Township, in Mille Lacs County, Minnesota, is a concrete slab bridge that carries U.S. Route\xa0169 (US\xa0169) over Whitefish Creek near Mille Lacs Lake. It is listed on the National Register of Historic Places for its architectural significance, especially the ornamental stonework as designed by the National Park Service and built by the Civilian Conservation Corps.', 'title': 'Bridge No. 3355-Kathio Township'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Kensington is a city in Douglas County, Minnesota, United States. The population was 292 at the 2010 census. The city is notable in Minnesota history for being the place where the famous, if questionable, Kensington Runestone was first displayed. The stone tablet may indicate that Scandinavians had come to Minnesota in the 14th century. It is now at a museum in nearby Alexandria, Minnesota.', 'title': 'Kensington, Minnesota'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Yarmouth Runic Stone, also known as the Fletcher Stone, is a slab of quartzite that first came to the attention of the public in the early 19th Century. The stone appears to have an inscription carved into it, which some investigators, notably Henry Phillips, Jr., have interpreted as Norse runes. This has led to speculation that the Yarmouth, Nova Scotia area, in Canada, was visited by Viking explorers sometime around 1000 C.E. Many other theories have been put forward, including the possibility of a hoax or the inscription being a product of natural forces. The Stone is currently on display at the Yarmouth County Museum.', 'title': 'Yarmouth Runic Stone'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Black Taj Mahal ("Black Taj", "Kaala Taj", also "the 2nd Taj") is a legendary black marble mausoleum that is said to have been planned to be built across the Yamuna River opposite the Taj Mahal in Agra, Uttar Pradesh, India. Mughal emperor Shah Jahan is said to have desired a mausoleum for himself similar to that of the one he had built in memory of his third wife, Mumtaz Mahal.', 'title': 'Black Taj Mahal'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Taj Mahal Palace Hotel (Marathi: ताजमहल हॉटेल) is a "Heritage Grand" class five-star hotel in the Colaba region of Mumbai, Maharashtra, India, next to the Gateway of India. Historically it was known as the "Taj Mahal Hotel" or the "Taj Palace Hotel". or simply "the Taj".', 'title': 'The Taj Mahal Palace Hotel'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Taj Heritage Corridor case is an alleged scam wherein 2002–2003, the then Chief Minister of Uttar Pradesh Mayawati and a minister in her government, Nasimuddin Siddiqui, were charged with corruption. The Taj Corridor project was intended to upgrade tourist facilities near the Taj Mahal and was to be implemented during her tenure as Chief Minister. The then BJP government at the Centre gave the Environmental Clearance required for the project near Taj Mahal. However, later on the BJP backed out and then started saying that the project was not cleared by the Environment Ministry and blamed Mayawati for starting construction work near the Taj Mahal.', 'title': 'Taj corridor case'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Taj Mahal or Mini Taj Mahal or Qadri's Taj Mahal, officially known as Maqbara Yadgare Mohabbat Tajammuli Begum is a replica of the historic Taj Mahal of Agra located in Kaser Kalan, a small village in Bulandshahar of Uttar Pradesh, India. It was built by 81 years old a retired postmaster, Faizul Hasan Qadri in the memory of his dead wife Tajamulli Begum, who died due to throat cancer in 2011.", 'title': 'Taj Mahal, Bulandshahar'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Taj Mahal Bangladesh (Bengali: তাজ মহল বাংলাদেশ )is a scaled copy of the original Taj Mahal (a Mughal mausoleum located in Agra, India) located 10 miles east of the Bangladeshi capital, Dhaka in Sonargaon. Unlike the original, work on the building took only five years. Ahsanullah Moni, a wealthy Bangladeshi film-maker, announced his \'Copycat version of Taj Mahal\' project in December 2008. The project cost about USD$56 Million, and was built 20 miles northeast of Capital Dhaka. Moni has explained that he built a replica of the Taj Mahal so that the poor of his nation can realise their dream of seeing neighbouring India\'s famed monument. This caused complaints from Indian officials, "You can\'t just go and copy historical monuments" an official of Indian High Commission in Dhaka told press.', 'title': 'Taj Mahal Bangladesh'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'R. Chandru is a Kannada film writer and director. He debuted with the successful 2008 film "Taj Mahal". The huge success of "Taj Mahal" film, he popularly came to be known as Taj Mahal Chandru in the media.', 'title': 'R. Chandru'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Taj Mahal is a 1963 film based on the historical legend of the Mughal emperor Shah Jahan. As per the legend Shah Jahan created the Taj Mahal in fond remembrance and as a tomb for his beloved wife Mumtaz Mahal.', 'title': 'Taj Mahal (1963 film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Kester "Smitty" Smith is an American percussionist. He is the drummer for the Taj Mahal Trio and has collaborated with jazz, blues and world musicians. He has performed with and alongside Taj Mahal for over forty years. He has recorded music with Taj Mahal, Geoff Muldaur, Peter Rowan, Cedella Booker, Morgan Freeman, Ellen McIlwaine, Mary Coughlan and Pinetop Perkins.', 'title': 'Kester Smith'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Agra Fort is a historical fort in the city of Agra in India. It was the main residence of the emperors of the Mughal Dynasty till 1638, when the capital was shifted from Agra to Delhi. The Agra fort is a UNESCO World Heritage site. It is about 2.5\xa0km northwest of its more famous sister monument, the Taj Mahal. The fort can be more accurately described as a walled city.', 'title': 'Agra Fort'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The Taj Mahal ( , more often ; meaning Crown of the Palace) is an ivory-white marble mausoleum on the south bank of the Yamuna river in the Indian city of Agra. It was commissioned in 1632 by the Mughal emperor, Shah Jahan (reigned 1628–1658), to house the tomb of his favourite wife, Mumtaz Mahal. The tomb is the centrepiece of a 42 acre complex, which includes a mosque and a guest house, and is set in formal gardens bounded on three sides by a crenellated wall.', 'title': 'Taj Mahal'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Forest Hill Chase Shopping Centre is a major regional shopping centre located in the eastern suburb of Forest Hill in Melbourne, Australia. Owned by Blackstone and managed by JLL, the centre is among the oldest in Victoria, opening on 30 June 1964 as an outdoor strip shopping centre, before being developed over the years into its current three level indoor form. Currently, Forest Hill Chase contains 200 stores and over 3500 free car parking spaces. The centre has three supermarkets, two discount department stores and one traditional department store spread across 3 levels. The architecture is distinguished by a roof of polycarbonate construction with a barrel vault design.', 'title': 'Forest Hill Chase Shopping Centre'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Forest Hill is a village in Forest Hill with Shotover civil parish in Oxfordshire, about 4.5 mi east of Oxford. The village about 330 ft above sea level is on the northeastern brow of a ridge of hills. The highest point of the ridge is Red Hill, which rises to 440 ft just south of the village. The 2011 Census recorded Forest Hill with Shotover's population as 856.", 'title': 'Forest Hill, Oxfordshire'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Forest Hill is a suburb of Wagga Wagga, New South Wales. Forest Hill is located approximately 10\xa0km east of the central business district on the Sturt Highway. RAAF Base Wagga, Wagga Wagga Airport and the Bureau of Meteorology Regional Office are located at Forest Hill.', 'title': 'Forest Hill, New South Wales'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Fort Worth is the 16th-largest city in the United States and the fifth-largest city in the state of Texas. The city is in North Central Texas and covers nearly 350 sqmi in the counties of Denton, Parker, Wise, and Tarrant, of which it is the county seat. According to the 2016 census estimates, Fort Worth\'s population is 854,113. The city is the second-largest in the Dallas–Fort\xa0Worth–Arlington metropolitan area (the "DFW Metroplex").', 'title': 'Fort Worth, Texas'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Forest Hill is a suburb of Fort Worth in Tarrant County, Texas, United States. The population was 12,355 at the 2010 census.', 'title': 'Forest Hill, Texas'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Forest Hill Pools is a local leisure centre in Forest Hill, London. After being closed in 2006, it was rebuilt including two pools and a health and fitness suite and reopened in September 2012. It is located close to Forest Hill railway station, Forest Hill Library and Sydenham School.', 'title': 'Forest Hill Pools'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Forest Hill with Shotover is a civil parish covering 7.56km² of South Oxfordshire approximately centred 3 mi east of Oxford. Its population in 2011 was 856, almost exclusively in the villages of Forest Hill, hamlets of Shotover Cleve and Shotover Edge. It includes a country estate at Shotover Park. Forest Hill with Shotover was formed in 1881 by the merger of three smaller civil parishes: Forest Hill, Shotover and Shotover Hill Place.', 'title': 'Forest Hill with Shotover'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Forest Hill was a provincial electoral district in Ontario, Canada. It was created prior to the 1963 provincial election and eliminated in 1975. Forest Hill riding was located in the former village of Forest Hill and the borough of York east of Dufferin Street. It had a large Jewish community, representing about 30% of the population.', 'title': 'Forest Hill (electoral district)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Forest Hill is a suburb of Melbourne, Victoria, Australia, 18\xa0km east of Melbourne's Central Business District. Its local government area is the City of Whitehorse. At the 2011 Census, Forest Hill had a population of 10,052. Forest Hill was recently ranked 93rd on Melbourne's most liveable suburb list, which was higher than other nearby popular suburbs such as Bentleigh, Mount Waverley and Glen Waverley.", 'title': 'Forest Hill, Victoria'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Forest Hill is an historic neighborhood spanning parts of Cleveland Heights and East Cleveland, Ohio, and is bordered to the north by Glynn Road, the south by Mayfield Road, by Lee Boulevard to the west and North Taylor Road to the east. Forest Hill was once the beloved summer home of oil magnate John D. Rockefeller and his family. John D. Rockefeller, Jr. purchased the estate from his father in 1923 and, with New York City architect Andrew J. Thomas, planned an upscale residential and commercial development featuring distinctive French Norman style architecture. Although the Great Depression forced Rockefeller to suspend operations, following World War II others were drawn to Forest Hill to build comfortable colonial and contemporary ranch homes on the remaining open land. Design principles of the Rockefeller-Thomas plan were extended to the later development and today Forest Hill is a rich tapestry of people, homes and gardens.', 'title': 'Forest Hill, Ohio'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Nobel Prize in Physiology or Medicine (Swedish: "Nobelpriset i fysiologi eller medicin" ) is awarded annually by the Swedish Karolinska Institute to scientists and doctors in the various fields of physiology or medicine. It is one of the five Nobel Prizes established by the 1895 will of Alfred Nobel (who died in 1896), awarded for outstanding contributions in chemistry, physics, literature, peace, and physiology or medicine. As dictated by Nobel\'s will, the award is administered by the Nobel Foundation and awarded by a committee that consists of five members and an executive secretary elected by the Karolinska Institute. While commonly referred to as the Nobel Prize in Medicine, Nobel specifically stated that the prize be awarded for "physiology or medicine" in his will. Because of this, the prize can be awarded in a broader range of fields. The first Nobel Prize in Physiology or Medicine was awarded in 1901 to Emil Adolf von Behring, of Germany. Each recipient receives a medal, a diploma and a monetary award that has varied throughout the years. In 1901, von Behring received 150,782 SEK, which is equal to 7,731,004 SEK in December 2008. In 2013, the prize was awarded to James E. Rothman, Randy W. Schekman and Thomas C. Südhof; they were recognised "after discovering how cells precisely transport material". The award is presented in Stockholm at an annual ceremony on December 10, the anniversary of Nobel\'s death.', 'title': 'List of Nobel laureates in Physiology or Medicine'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Frederick Duncan Michael Haldane {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (born 14 September 1951), known as F. Duncan Haldane, is a British born physicist who is Eugene Higgins Professor of Physics at the physics department of Princeton University, and a Distinguished Visiting Research Chair at Perimeter Institute for Theoretical Physics. He won the 2016 Nobel Prize in Physics with David J. Thouless and John Michael Kosterlitz.', 'title': 'Duncan Haldane'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Nobel Prize in Chemistry (Swedish: "Nobelpriset i kemi" ) is awarded annually by the Royal Swedish Academy of Sciences to scientists in the various fields of chemistry. It is one of the five Nobel Prizes established by the 1895 will of Alfred Nobel, who died in 1896. These prizes are awarded for outstanding contributions in chemistry, physics, literature, peace, and physiology or medicine. As dictated by Nobel\'s will, the award is administered by the Nobel Foundation and awarded by a committee that consists of five members elected by the Royal Swedish Academy of Sciences. The first Nobel Prize in Chemistry was awarded in 1901 to Jacobus Henricus van \'t Hoff, of the Netherlands. Each recipient receives a medal, a diploma and a monetary award prize that has varied throughout the years. In 1901, van \'t Hoff received 150,782 SEK, which is equal to 7,731,004 SEK in December 2007. The award is presented in Stockholm at an annual ceremony on December 10, the anniversary of Nobel\'s death.', 'title': 'List of Nobel laureates in Chemistry'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Serge Haroche (born 11 September 1944) is a French physicist who was awarded the 2012 Nobel Prize for Physics jointly with David J. Wineland for "ground-breaking experimental methods that enable measuring and manipulation of individual quantum systems", a study of the particle of light, the photon. This and his other works developed laser spectroscopy. Since 2001, Haroche is a Professor at the Collège de France and holds the Chair of Quantum Physics. In 1971 he defended his doctoral thesis in physics at the University of Paris VI, his research has been conducted under the direction of Claude Cohen-Tannoudji.', 'title': 'Serge Haroche'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Since 1901, the Nobel Prize in Literature (Swedish: "Nobelpriset i litteratur" ) has been awarded annually to an author from any country who has, in the words of the will of Alfred Nobel, produced "in the field of literature the most outstanding work in an ideal direction" (original Swedish: "den som inom litteraturen har producerat det mest framstående verket i en idealisk riktning"). Though individual works are sometimes cited as being particularly noteworthy, here "work" refers to an author\'s work as a whole. The Swedish Academy decides who, if anyone, will receive the prize in any given year. The academy announces the name of the chosen laureate in early October. It is one of the five Nobel Prizes established by the will of Alfred Nobel in 1895; the others are the Nobel Prize in Chemistry, Nobel Prize in Physics, Nobel Peace Prize, and Nobel Prize in Physiology or Medicine.', 'title': 'Nobel Prize in Literature'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Nobel Prizes are awarded annually by the Royal Swedish Academy of Sciences, the Swedish Academy, the Karolinska Institute, and the Norwegian Nobel Committee to individuals who make outstanding contributions in the fields of Chemistry, Physics, Literature, Peace, Physiology or Medicine and Economics. All but the economics prize were established by the 1895 will of Alfred Nobel, which dictates that the awards should be administered by the Nobel Foundation. The Nobel prize in Economics, or The Sveriges Riksbank Prize in Economic Sciences in Memory of Alfred Nobel, was established in 1968 by the Sveriges Riksbank, the central bank of Sweden, for outstanding contributions in the field of Economics. Each prize is awarded by a separate committee; the Royal Swedish Academy of Sciences awards the Prizes in Physics, Chemistry, and Economics, the Swedish Academy awards the Prize in Literature, the Karolinska Institute awards the Prize in Physiology or Medicine, and the Norwegian Nobel Committee awards the Prize in Peace. Each recipient receives a medal, a diploma and a cash prize that has varied throughout the years.', 'title': 'List of female Nobel laureates'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'François Baron Englert (] ; born 6 November 1932) is a Belgian theoretical physicist and 2013 Nobel prize laureate (shared with Peter Higgs). He is Professor emeritus at the Université libre de Bruxelles (ULB) where he is member of the Service de Physique Théorique. He is also a Sackler Professor by Special Appointment in the School of Physics and Astronomy at Tel Aviv University and a member of the Institute for Quantum Studies at Chapman University in California. He was awarded the 2010 J.\xa0J.\xa0Sakurai Prize for Theoretical Particle Physics (with Gerry Guralnik, C.\xa0R.\xa0Hagen, Tom Kibble, Peter Higgs, and Robert Brout), the Wolf Prize in Physics in 2004 (with Brout and Higgs) and the High Energy and Particle Prize of the European Physical Society (with Brout and Higgs) in 1997 for the mechanism which unifies short and long range interactions by generating massive gauge vector bosons. He has made contributions in statistical physics, quantum field theory, cosmology, string theory and supergravity. He is the recipient of the 2013 Prince of Asturias Award in technical and scientific research, together with Peter Higgs and the CERN.', 'title': 'François Englert'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Nobel Prize in Physics (Swedish: "Nobelpriset i fysik" ) is a yearly award given by the Royal Swedish Academy of Sciences for those who conferred the most outstanding contributions for mankind in the field of physics. It is one of the five Nobel Prizes established by the will of Alfred Nobel in 1895 and awarded since 1901; the others being the Nobel Prize in Chemistry, Nobel Prize in Literature, Nobel Peace Prize, and Nobel Prize in Physiology or Medicine.', 'title': 'Nobel Prize in Physics'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'David Jeffrey Wineland (born February 24, 1944) is an American Nobel-laureate physicist at the National Institute of Standards and Technology (NIST) physics laboratory. His work has included advances in optics, specifically laser cooling trapped ions and using ions for quantum computing operations. He was awarded the 2012 Nobel Prize in Physics, jointly with Serge Haroche, for "ground-breaking experimental methods that enable measuring and manipulation of individual quantum systems."', 'title': 'David J. Wineland'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Brian David Josephson, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (born 4 January 1940), is a Welsh theoretical physicist and professor emeritus of physics at the University of Cambridge. Best known for his pioneering work on superconductivity and quantum tunnelling, he was awarded the Nobel Prize in Physics in 1973 for his prediction of the Josephson effect, made in 1962 when he was a 22-year-old PhD student at Cambridge University. Josephson is the only Welshman to have won a Nobel Prize in Physics. He shared the prize with physicists Leo Esaki and Ivar Giaever, who jointly received half the award for their own work on quantum tunnelling.', 'title': 'Brian Josephson'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Storax or snowbell is the common names of Styrax, a genus of about 130 species of large shrubs or small trees in the family Styracaceae, mostly native to warm temperate to tropical regions of the Northern Hemisphere, with the majority in eastern and southeastern Asia, but also crossing the equator in South America. The resin obtained from the tree is called storax or benzoin (not to be confused with the "Liquidambar" storax balsam).', 'title': 'Styrax'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Styrax crotonoides is a species of plant in the genus "Styrax" and family Styracaceae. It is found in Peninsular Malaysia and Singapore.', 'title': 'Styrax crotonoides'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Rapanea is a genus of plant in family Primulaceae. It has often been placed in synonymy with "Myrsine", and many species have been moved to "Myrsine".', 'title': 'Rapanea'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Benzoin or benjamin is a balsamic resin obtained from the bark of several species of trees in the genus "Styrax". It is used in perfumes, some kinds of incense, as a flavoring, and medicine (see tincture of benzoin). It is distinct from the chemical compound benzoin, which is ultimately derived from benzoin resin; the resin, however, does not contain this compound.', 'title': 'Benzoin (resin)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Styrax fraserensis is a species of flowering plant in the genus "Styrax" and family Styracaceae. It is a tree endemic to Peninsular Malaysia. It is threatened by habitat loss.', 'title': 'Styrax fraserensis'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Myrsine is a genus of flowering plants in the family Primulaceae. It was formerly placed in the family Myrsinaceae before this was merged into the Primulaceae. It is found nearly worldwide, primarily in tropical and subtropical areas. It contains about 200 species, including several notable radiations, such as the matipo of New Zealand and the kōlea of Hawaiʻ i (the New Zealand "black matipo", "Pittosporum tenuifolium", is not related to "Myrsine"). In the United States, members of this genus are known as colicwood. Some species, especially "M. africana", are grown as ornamental shrubs.', 'title': 'Myrsine'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Styrax vilcabambae (syn. "Pamphilia vilcabambae" D.R.Simpson) is a species of flowering plant in the genus "Styrax" and the family Styracaceae. It is endemic to Peru.', 'title': 'Styrax vilcabambae'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Pterostyrax, the epaulette tree, is a small genus of four species of deciduous large shrubs or small trees in the family Styracaceae, native to eastern Asia in China and Japan. They grow 4 - tall, with alternate, simple ovate leaves 6 - long and 4 - broad. The flowers are white, produced in dense panicles 8 - long. The fruit is an oblong dry drupe, with longitudinal ribs or narrow wings (the wings are absent in the related genus "Styrax", whence the name "Pterostyrax", "winged styrax").', 'title': 'Pterostyrax'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Styrax litseoides is a species of flowering plant in the genus "Styrax" and family Styracaceae. It is endemic to Vietnam.', 'title': 'Styrax litseoides'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Ardisia (coralberry or marlberry) is a genus of flowering plants in the family Primulaceae. It was in the former Myrsinaceae family now recognised as the myrsine sub-family Myrsinoideae. They are distributed in the Americas, Asia, Australia, and the Pacific Islands, mainly in the tropics. There are 400 to 500 species.', 'title': 'Ardisia'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Cliven D. Bundy (born April 29, 1946) is an American cattle rancher from Bunkerville, Nevada who is currently federally incarcerated and awaiting trial with bail denied for his role in the 2014 Bundy standoff. He vocally advocated a philosophy opposed to what he views as federal government overreach. He is known for having participated in the 2014 Bundy Standoff in Nevada, an armed standoff with federal and state law enforcement over defaulted grazing fees. Some viewed him as a hero for having led a movement of ranchers to encourage more ranchers to join him in defaulting on their grazing fees as per their federal grazing contracts. Some considered him to be dangerously provocative. He is the father of Ammon Bundy, who in 2016 also led another armed standoff against the government, the occupation of the Malheur National Wildlife Refuge in Oregon.', 'title': 'Cliven Bundy'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Forage Value Index is a derived index of the relative change in the previous year’s average monthly rate per head for pasturing cattle on privately owned land in the West. Used in calculating federal grazing fees.', 'title': 'Forage value index'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Citizens for Constitutional Freedom (C4CF), later also known as People for Constitutional Freedom (P4CF), was the name taken on January 4, 2016, by an armed private U.S. militia that occupied the U.S. Fish and Wildlife Service's Malheur National Wildlife Refuge headquarters in the U.S. state of Oregon from January 2 to February 11, 2016. The leader of the organization was Ammon Bundy, son of Cliven D. Bundy, who engaged in a standoff with the federal government over grazing rights on federal land.", 'title': 'Citizens for Constitutional Freedom'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Universal Transit Pass or Universal Access Transit Pass (U-Pass) is a program that gives students enrolled in participating post-secondary institutions unlimited access to local transit. Programs are either funded through mandatory fees that eligible students pay in each term in which they are registered or included in the students' tuition. For example, the University of Washington and the U-Pass program in Chicago have mandatory U-Pass fees. Fees are transferred to the local transit authority to fund the required transit service. Because fees are collected from a large participant base, U-Pass prices are lower than the amount students would otherwise pay for monthly passes or tickets over the course of a term. The U-Pass price charged to students depends on a variety of factors which differ among municipalities, transit systems and post-secondary institutions.", 'title': 'Universal transit pass'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Stealth inflation is a type of charges or fees created by businesses to gain extra profit and revenue from its customers. The stealth part of the term is that business will often use miscellaneous fees to charge customers without the customers even knowing the fees existed as they were hidden in the fine print of a signed a contract. The inflation part of the term relates to the up charging of the service without actually providing anything additional. Since most companies charge a fee to accept payment, a portion gets built into profit and revenue. A big example of stealth inflation can be overdraft fees from banks surcharges from Telco providers, processing fees and installation fees. Another form of stealth inflation is devaluation of money by a government, sometimes in order to pay off debt with lower value currency. The unintended higher cost of imported goods and raw material is passed on to the consumer yet not part of traditional definition of inflation.', 'title': 'Stealth inflation'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'In United States environmental policy, maintenance fees are the annual fees paid by pesticide manufacturers and formulators to continue registration of pesticide active ingredients and products with the Environmental Protection Agency (EPA). The fees supplement funds appropriated from general U.S. revenues, which cover most administrative costs of the EPA pesticide program under the Federal Insecticide, Fungicide, and Rodenticide Act (FIFRA; 7 U.S.C. 136a-1). Fees are deposited into a separate Reregistration and Expedited Processing Fund to offset costs associated with EPA reregistration activities and expedited processing of pesticide registrations that are substantially similar to registrations already in effect or which are for public health pesticides, as defined in FIFRA Section 2(nn). Congress mandated collection of an annual maintenance fee from each pesticide registrant in 1988 amendments to (P.L. 100-532). EPA has authority to cancel a registration if a registrant fails to pay the maintenance fee.', 'title': 'Maintenance fee (EPA)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "In 2012, James Hucks filed suit against Sentinel Offender Services after an arrest warrant was issued for his wife because she did not pay all the fees she owed to the company during her probation. In 2013, Georgia judge Daniel J. Craig ruled that Sentinel had to refund hundreds, and possibly thousands, of people who had paid them, and that private probation companies cannot collect fees from probationers after their probation has expired. Later that year, Craig granted Sentinel a stay on this ruling, but, despite their attempts to persuade him to back down on it, refused to undo his restrictions. In 2012, Georgia man Tom Barrett stole a can of beer and was later put on probation with Sentinel after being unable to pay a US$200 fine. He was later put in jail for two months after being unable to pay Sentinel's startup fee. As of May 2015, Barrett was suing Sentinel, and was being represented by Augusta attorney Jack Long. On February 17, 2016, the Southern Center for Human Rights filed a lawsuit against Sentinel on behalf of two women from Cleveland, Georgia who were sentenced to 12 months probation each for not paying fines; the lawsuit also claims both women were told they had to undergo drug tests by a probation officer.", 'title': 'Sentinel Offender Services'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "In the field of law and economics, the English rule (capitalized as English Rule in some jurisdictions) is a rule controlling assessment of attorneys' fees arising out of litigation. The English rule provides that the party who loses in court pays the other party's attorney's fees. The English rule contrasts with the American rule, under which each party is generally responsible to pay its own attorneys' fees, unless a statute or contract provides for that assessment. The rationale for the English rule is that a litigant (whether bringing a claim or defending a claim) is entitled to legal representation and, if successful, should not be left out of pocket by reason of his or her own legal fees. It should be borne in mind that, in virtually all English civil litigation, damages are merely compensatory.", 'title': "English rule (attorney's fees)"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'One of the key advertising campaigns of The Villages is that residents are able to play "free golf for life". The advertising is only partially true; the "free golf" is paid for by mandatory amenities fees assessed to all homeowners in The Villages. The "free golf" extends only to the executive golf courses and only to players walking the courses, wherein a greens fee is not assessed. Players riding golf carts on executive courses pay no greens fee but must pay a trail fee. Greens fees and trail fees are required on The Villages country club courses (though memberships are provided "free" – again, as part of the amenities fee – to residents).', 'title': 'List of golf courses in The Villages'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "The 2014 Bundy standoff was an armed confrontation between supporters of cattle rancher Cliven Bundy and law enforcement following a 21-year legal dispute in which the United States Bureau of Land Management (BLM) had obtained court orders directing Bundy to pay over $1 million in withheld grazing fees for Bundy's use of federally owned land adjacent to Bundy's ranch in southeastern Nevada.", 'title': 'Bundy standoff'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'John Marcellus Huston ( ; August 5, 1906\xa0– August 28, 1987) was an American film director, screenwriter and actor. He wrote the screenplays for most of the 37 feature films he directed, many of which are today considered classics: "The Maltese Falcon" (1941), "The Treasure of the Sierra Madre" (1948), "The Asphalt Jungle" (1950), "The African Queen" (1951), "The Misfits" (1961), "Fat City" (1972) and "The Man Who Would Be King" (1975). During his 46-year career, Huston received 15 Oscar nominations, won twice, and directed both his father, Walter Huston, and daughter, Anjelica Huston, to Oscar wins in different films.', 'title': 'John Huston'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"The Train" is an early short story by the American author Flannery O\'Connor. It is one of the six stories included in O\'Connor\'s 1947 master\'s thesis "The Geranium: A Collection of Short Stories" and was published in "The Sewanee Review" in 1948. It later appeared in the 1971 collection "The Complete Stories". O\'Connor revised this story into the first chapter of her novel, "Wise Blood".', 'title': 'The Train (short story)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Wise Blood is the first novel by American author Flannery O\'Connor, published in 1952. The novel was assembled from disparate stories first published in "Mademoiselle", "Sewanee Review" and "Partisan Review". The first chapter is an expanded version of her Master\'s thesis, "The Train", and other chapters are reworked versions of "The Peeler," "The Heart of the Park" and "Enoch and the Gorilla". The novel concerns a returning World War II veteran who, haunted by a lifelong crisis of faith, resolves to form an anti-religious ministry in an eccentric Southern town.', 'title': 'Wise Blood'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Wise Blood is an American 1979 drama film directed by John Huston and based on the 1952 novel "Wise Blood" by Flannery O\'Connor. It was filmed mostly in and around Macon, Georgia, near O\'Connor\'s home Andalusia in Baldwin County, using many local residents as extras. Though largely faithful to O\'Connor\'s novel, Huston reframes many scenes from the book as broad comedy accompanied by a bluegrass banjo score. The original music score was composed by Alex North. The film was titled Der Ketzer or Die Weisheit des Blutes when released in Germany, and Le Malin when released in France.', 'title': 'Wise Blood (film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Amy Wright (born April 15, 1950 in Chicago) is an American actress and former model. She has appeared in such films as "The Deer Hunter", "Breaking Away", "The Amityville Horror", "Heartland", "Wise Blood", "Stardust Memories", "The Accidental Tourist", "Hard Promises", "Crossing Delancey" and "Miss Firecracker".', 'title': 'Amy Wright'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Walter "Tony" Antony Huston (born April 16, 1950) is an American actor, writer, and assistant director. He is known for his work on "The List of Adrian Messenger" (1963), "The Dead" (1987), "Wise Blood" (1979), "" (2010), "" (2008), "Look Up and Wave Your Glove" (2005), "Great Performances" (2002), "" (2001), and "John Huston and the Dubliners" (1987). He is the son of John Huston and Enrica Soma, and sibling of Anjelica Huston, Danny Huston, and Allegra Huston. His son is actor Jack Huston.', 'title': 'Tony Huston'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"The Peeler" is a short story by the American author Flannery O\'Connor. It was first published in "Partisan Review" in 1949. It later appeared in the 1971 collection "The Complete Stories". It was eventually incorporated into her novel, "Wise Blood".', 'title': 'The Peeler'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Benedict Fitzgerald (born 1949) is an American screenwriter who co-wrote the screenplay for "The Passion of the Christ" with Mel Gibson. His other writing credits include a television screenplay of "Moby-Dick" in 1998 (uncredited) and "Wise Blood" in 1979.', 'title': 'Benedict Fitzgerald'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Shajoon Kariyal is an Indian film director and producer working in Malayalam cinema. Shajoon was born in 1963 in Kozhikode, Kerala and had his primary education from Govt. Ganapath High School, Chalappuram. He started his film career in 1984, at the age of 18, as an assistant director to I. V. Sasi. He worked as the assistant or associate director to many films including "Uyarangalil" (1984), "Anubandham" (1985), "Karimpinpoovinakkare" (1985), "Aavanazhi" (1986), "1921" (1988), "Douthyam" (1989), "Varthamana Kalam" (1990), "Arhatha" (1990), "Midhya" (1991), "Neelagiri" (1991) and "Varnapakittu" (1997). He was the story writer for the Mammootty-starrer megahit "Jackpot" (1993). He debuted as a director with "Rajaputhran" (1996), starring Suresh Gopi, Shobhana and Vikram. He has directed many films, including the commercially successful "Thachiledathu Chundan" (1999) and the critically acclaimed "Vadakkumnadhan" (2006). After "Vadakkumnadhan", he planned two films, "Raman Police" and "Talkies", but both the projects did not work out. In 2012, he directed "Chettayees" which he also co-produced, as one of the five partners of the newly launched production house Thakkaali Films. His latest film is "Sir C. P." (2015).', 'title': 'Shajoon Kariyal'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Wiseblood is the fifth album by Corrosion of Conformity. Its name comes from the novel "Wise Blood", written by Southern Gothic author Flannery O\'Connor. Metallica\'s lead vocalist, James Hetfield, provides his voice as backup on the album\'s ninth track, "Man or Ash". The song "Drowning in a Daydream" was nominated for Best Metal Performance at the 40th Grammy Awards ceremony (which went to Tool for "Ænema").', 'title': 'Wiseblood (Corrosion of Conformity album)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Mai Al-Nakib is author of "The Hidden Light of Objects", a collection of linked short stories published by Bloomsbury in 2014. The collection won the Edinburgh International Book Festival\'s 2014 First Book Award, the first collection of short stories to win. Her short stories have appeared in "Ninth Letter""," "The First Line", and the anthology "Novel of the World""." Two of her stories received honorable mention in "Glimmer Train" competitions. "The Hidden Light of Objects" is her first collection of short stories.', 'title': 'Mai Al-Nakib'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Richard Marsh (12 October 1857 – 9 August 1915) was the pseudonym of the English author born Richard Bernard Heldmann. A best-selling and prolific author of the late 19th century and the Edwardian period, Marsh is best known now for his supernatural thriller novel "The Beetle", which was published the same year as Bram Stoker\'s "Dracula" (1897), and was initially even more popular. "The Beetle" remained in print until 1960. Marsh produced nearly 80 volumes of fiction and numerous short stories, in genres including horror, crime, romance and humour. Many of these have been republished recently, beginning with "The Beetle" in 2004. Marsh\'s grandson Robert Aickman was a notable writer of short "strange stories".', 'title': 'Richard Marsh (author)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ambulance (Original title: "Ambulanse") is a collection of short stories by the Norwegian author Johan Harstad, published in 2002. The collection contains eleven short stories, all connected to each other. The main character in one of the stories shows up as an \'extra\' in the next, and several stories are told from different angles. The overall link between the short stories is an ambulance driving through an unnamed city.', 'title': 'Ambulanse'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'A Good Man Is Hard to Find and Other Stories (published in England as The Artificial Nigger and Other Tales) is a collection of short stories by American author Flannery O\'Connor. The collection was first published in 1955. The subjects of the short stories range from baptism ("The River") to serial killers ("A Good Man Is Hard to Find") to human greed and exploitation ("The Life You Save May Be Your Own"). The majority of the stories include jarring violent scenes that make the characters undergo a spiritual change. The short stories commonly have tones of Catholicism related to life and death scenarios. For instance, in the story "A Good Man Is Hard To Find" the villain states, "She would have been a good woman if it had been somebody there to shoot her every minute of her life."', 'title': 'A Good Man Is Hard to Find and Other Stories'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Rest of the Robots is a collection of eight short stories and two full-length novels by American writer Isaac Asimov, published in 1964. The stories, centred on positronic robots, are all part of the "Robot" series, most of which take place in the "Foundation" universe. Another collection of short stories about robots, "I, Robot", was re-published in the previous year, which is why Asimov chose to title the collection as "The Rest of the Robots". None of the short stories in this collection were in "I, Robot", however all of them were later included in "The Complete Robot", and both novels about Elijah Baley were also published separately.', 'title': 'The Rest of the Robots'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Richard Henderson Honaker (born March 10, 1951) is a lawyer in Rock Springs, Wyoming who was nominated on March 19, 2007, by U.S. President George W. Bush to serve as one of three U.S. District Judges for the District of Wyoming. The nomination was given the highest "well qualified" rating by the judicial evaluation committee of the American Bar Association. Honaker was initially recommended to Bush by U.S. Senator Craig L. Thomas of Wyoming, who died some three months later. Honaker had co-chaired Thomas\' reelection campaign in 2006 in Rock Springs. Honaker never obtained a Senate vote on his confirmation. The succession of Barack Obama to the presidency ended his candidacy. Had he been confirmed, Honaker would have succeeded Judge Clarence A. Brimmer in Cheyenne. Nancy D. Freudenthal was subsequently nominated and confirmed to the seat.', 'title': 'Richard Honaker'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'J. J. Syvrud (born May 10, 1977) is a former American football linebacker who played one season with the New York Jets of the National Football League. He was drafted by the New York Jets in the seventh round of the 1999 NFL Draft. He played college football at Jamestown College and attended Rock Springs High School in Rock Springs, Wyoming.', 'title': 'J. J. Syvrud'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Vacuum Diagrams is a collection of science fiction short stories by British writer Stephen Baxter. The collection connects the novels of the Xeelee Sequence and also shows the history of mankind in the Xeelee universe, and ultimately the universe. While each short story in the collection is self-contained, the stories are presented as being contained in the context of the first story, "Eve", about a man (seemingly Jack Raoul from the portion of the timeline concerned with the silver ghosts) who is forced to witness the events in the short stories by a god-like being. "Eve" acts as a structure for the short stories, with an introduction at the beginning of "Vacuum Diagrams", short scenes occurring between each "era" (with "Eve" character explaining and introducing the next section), and an ending that wraps up the plot for the "Eve" story itself. "Vacuum Diagrams" won the Philip K. Dick Award in 1999.', 'title': 'Vacuum Diagrams'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Richard Ford (born February 16, 1944) is an American novelist and short story writer. His best-known works are the novel "The Sportswriter" and its sequels, "Independence Day", "The Lay of the Land" and "Let Me Be Frank With You", and the short story collection "Rock Springs", which contains several widely anthologized stories.', 'title': 'Richard Ford'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Rock Springs is a collection of short stories by author Richard Ford, published in 1987 and largely dealing with dysfunctional mothers and fathers and their effects on young male narrators.', 'title': 'Rock Springs (short story collection)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Sophie Simone Cortina is a reporter, television host, sports reporter, voice over talent, designer, writer, photographer and, to a lesser extent, actor living between Los Angeles, CA, Chicago, IL, New York City, U.S., Mexico City, Mexico, and Europe. Prior to her career as an entertainer and reporter, she had a professional tennis career and was three times national tennis champion in Mexico and also was ranked in the Top 20 in the world as a junior tennis player. And she is the voice of Curie in the game Fallout 4.', 'title': 'Sophie Simone Cortina'}
