 {'idx': 3, 'is_supporting': False, 'paragraph_text': "David Goffin (] ) (born 7 December 1990) is a Belgian professional tennis player who is currently ranked world No. 12 in men's singles by the Association of Tennis Professionals (ATP). He was born in Rocourt, Liège, Belgium. His breakthrough came when he reached the fourth round of the 2012 French Open as a lucky loser, eventually losing to Roger Federer in four sets. Goffin has defeated several higher-ranked players such as John Isner, Stan Wawrinka, Novak Djokovic, Marin Čilić, Milos Raonic, Jo-Wilfried Tsonga, Dominic Thiem and Tomáš Berdych, the latter without losing a game. He is the Belgian number 1 male tennis player as of 2017. On February 20, 2017 Goffin became the first Belgian male tennis player to reach the ATP top 10.", 'title': 'David Goffin'}
