 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Reginald "Reggie" or "R. F." Frank Doherty (14 October 1872 – 29 December 1910) was a British tennis player and the older brother of tennis player Laurence Doherty. He was known in the tennis world as "R.F." rather than "Reggie". He was a four-time Wimbledon singles champion and a triple Olympic Gold medalist in doubles and mixed doubles.', 'title': 'Reginald Doherty'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Fabio Fognini (] ; born 24 May 1987) is an Italian professional tennis player who is currently ranked world No. 29 in men's singles by the Association of Tennis Professionals (ATP) and the current Italian No. 1. His career-high singles ranking is world No. 13, achieved in March 2014, and world No. 7 in doubles, achieved in July 2015. Fognini's most successful surface is red clay, upon which he won his four ATP singles titles in Stuttgart, Hamburg, Viña del Mar and Umag, reached the quarterfinals of the 2011 French Open and the semifinals of the 2013 Monte-Carlo Masters. Together with Simone Bolelli, Fognini won the 2015 Australian Open doubles event, becoming the first all Italian men's pair to win a Grand Slam title in the Open era.", 'title': 'Fabio Fognini'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Pam Teeguarden (born April 17, 1951) is a former American professional tennis player in the 1970s and 1980s, ranked in the top 20 from 1970–1975, according to "John Dolan\'s Women\'s Tennis Ultimate Guide", prior to computer rankings. She won two Grand Slam Doubles Titles and was a quarter finalist in singles at the U.S. Open and The French Open. Her father Jerry, a well known coach, helped Margaret Court win the coveted Grand Slam (all four Grand Slam titles in one year) in 1970 and Virginia Wade to her 1977 Wimbledon triumph. Teeguarden was voted the "Most Watchable Player" based on play and appearance by a group of Madison Avenue advertising executives or "Mad Men" while playing at the US Open. Teeguarden played in 19 consecutive US Opens, holding the record until Chris Evert played in 20. She wore the first all black outfit in the history of tennis in 1975 at The Bridgestone Doubles Championships in Tokyo, starting a trend that is still popular today. Teeguarden was the first woman tennis player signed by Nike. She played on the victorious Los Angeles Strings Team Tennis team in 1981 and won the Team Tennis Mixed Doubles Division with Tom Gullikson in 1977; they were also runners-up in the league that year.', 'title': 'Pam Teeguarden'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'American tennis player Pancho Gonzales had a long-running rivalry with Australian Ken Rosewall. Gonzales is still sometimes considered to be a candidate for the greatest tennis player of all time; he was the dominant player of the 1950s and still holds the men\'s all-time record of being ranked world No. 1 for eight years. Rosewall became the world\'s best player upon Gonzales\'s semi-retirement in 1961 and held that position either by himself or sharing it with others for six years. Rosewall was signed in 1956 by the promoter Jack Kramer, a former #1 player himself, to join his small band of touring professionals in 1957. He then engaged in a round-the-world, head-to-head tour against Gonzales, the defending world\'s champion, over the next five months, winning 26 matches but losing 50. In his 1979 autobiography Kramer included both Gonzales and Rosewall in his list of the 21 greatest players of all time. Kramer, however, initially "panicked" upon signing Rosewall.He was a cute little fellow with a dink serve, who operated mostly from the baseline. That great volley of his hadn\'t been developed yet. I was afraid that Gorgo would eat him alive and put us out of business the rest of the way. But like a lot of people I completely underestimated Rosewall. Before their opening match in Melbourne, Kramer went to Gonzales and asked him to "carry" Rosewall, giving him a better share of the gate to gain his assent. Gonzales did try to carry out his part of the deal for a few matches, but then called it off, telling Kramer that he was no longer able to play his normal game. Kramer agreed. "It was... obvious that Rosewall was not the pushover I had feared. (In fact, Gonzales only beat him 50–26, and it was always competitive.)" Six years older than Rosewall, 13 years later, in 1970, Gonzales defeated him in 6–4, 6–4, in the 199th and next-to-last match they ever played—Gonzales was 42 years old at the time and Rosewall was considered to be the co-No. 1 player in the world.', 'title': 'Gonzales–Rosewall rivalry'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "Simone Bolelli (born 8 October 1985; ] ) is an Italian professional tennis player. Bolelli is a Grand Slam champion since he won the 2015 Australian Open doubles event with Fabio Fognini, becoming the first all Italian men's pair to win a Grand Slam title in the Open Era.", 'title': 'Simone Bolelli'}]

