 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Belgian national bobsleigh team represents Belgium in international bobsledding competitions. Belgium first gained fame in bobsleighing during their debut at the first Winter Olympics in Chamonix in 1924, where a Belgian four-man bob acquired the bronze medal. The second and last Belgian bobsleigh medal at the Winter Olympics so far, also won during a four-man event, was a silver in St. Moritz in 1948.', 'title': 'Belgium national bobsleigh team'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Jeanne Chesley Ashworth (born July 1, 1938) is an American former speed skater who competed in the 1960 Winter Olympics, 1964 Winter Olympics and 1968 Winter Olympics. Ashworth competed in the first Olympic speed skating event for women. She won the bronze medal, finishing behind a German and Russian. During the late 50's and 60's, when Ashworth was at the height of her career, she won 11 national championships.", 'title': 'Jeanne Ashworth'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Yang Yang (; born 24 August 1976 in Jiamusi, Heilongjiang, China) is a former Chinese short track speed skater and current IOC member. She is a two-time Olympic Champion from 2002 Winter Olympics and a six-time Overall World Champion for 1997–2002. She was formerly a member of the Chinese national short track team. Yang is one of the most accomplished short track speed skaters of all time having won 34 world titles, including six Overall World Championships. She is the first person to have won six Overall World Titles and won six consecutively. Her victory in the women's 500 m short track at the 2002 Winter Olympics made her China's first-ever Winter Olympics gold medalist. She added a second gold in the women's 1000 m short track at the same Games and has also won two silver and a bronze medal. After 2003 World Championships, Yang took time off competing, but came back in 2004–2005 season in lead-up to 2006 Winter Olympics where she won the bronze medal in 1000m race. She retired soon afterwards.", 'title': 'Yang Yang (A)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Marja-Liisa Kirvesniemi (née Hämäläinen; born 10 September 1955) is a Finnish former cross-country skier. She was the big figure at the 1984 Olympics in Sarajevo, winning all three individual cross-country skiing events (5, 10 and 20\xa0km), and a bronze medal for Finland in the relay. In the process, she became the most successful athlete at the 1984 Winter Olympics. At the 1988 Winter Olympics in Calgary, she won another relay bronze medal, and at the 1994 Winter Olympics in Lillehammer, she won two more bronze medals in the 5 and 30\xa0km.', 'title': 'Marja-Liisa Kirvesniemi'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Vladimír Nadrchal (born March 4, 1938 in Pardubice, Czechoslovakia) is an ice hockey player who played for the Czechoslovak national team. He won a bronze medal at the 1964 Winter Olympics, and a silver medal at the 1968 Winter Olympics.', 'title': 'Vladimír Nadrchal'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Jozef Golonka (born January 6, 1938) is a former ice hockey player who played in the Czechoslovak Extraliga and was a member of the Czechoslovakia national ice hockey team. He won a bronze medal in the 1964 Winter Olympics in Innsbruck, Austria and won a silver medal in the 1968 Winter Olympics in Grenoble, France. He was inducted into the International Ice Hockey Federation Hall of Fame in 1998.', 'title': 'Jozef Golonka'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Mārtiņš Rubenis (born 26 September 1978) is a retired Latvian luger who competed between 1998 and 2014. He won the bronze medal at the men's singles event at the 2006 Winter Olympics in Turin, becoming the first Latvian (i.e. representing Republic of Latvia) to win a medal at the Winter Olympics and the only one from Latvia at the 2006 Winter Olympics. He won his second bronze medal at the 2014 Winter Olympics in Sochi in the Team Relay event.", 'title': 'Mārtiņš Rubenis'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Gildo Siorpaes (born January 12, 1938 in Cortina d'Ampezzo) is an Italian bobsledder who competed in the early 1960s. He was born in Cortina d'Ampezzo. He won a bronze medal in the four-man event at the 1964 Winter Olympics in Innsbruck.", 'title': 'Gildo Siorpaes'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Rafayel Davidovich Grach (Russian: Рафаель Давидович Грач ; August 6, 1932 – June 14, 1982) was a Soviet speed skater who competed in the 1956 Winter Olympics, 1960 Winter Olympics and 1964 Winter Olympics. He was born in Kirov, Russia. Grach won the silver medal at the 1956 Winter Olympics and bronze medal at the 1960 Winter Olympics in speed skating.', 'title': 'Rafayel Grach'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Imperial War Museum is a British national museum organisation with branches at five locations in England.', 'title': 'Imperial War Museum (disambiguation)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'British National Bibliography (BNB) was established to publish a list of the books, journals and serials that are published in the United Kingdom and Republic of Ireland. It also includes information on forthcoming titles. New books and serials have been recorded in the British National Bibliography (BNB) since 1950. The British National Bibliography was first established at the British Museum. This is the single most comprehensive listing of UK titles. UK and Irish publishers are obliged by legal deposit to send a copy of all new publications, including serial titles to BNB for listing. The BNB publish the list weekly in electronic form: the last printed weekly list appeared in December 2011.', 'title': 'British National Bibliography'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Mario Martinez (born 1953) is a contemporary abstract painter. He is a Native American artist who is a member of the Pascua Yaqui Tribe from New Penjamo (in Scottsdale), the smallest of six Yaqui settlements, in Arizona. He currently lives in New York City. Martinez received his bachelor\'s degree from School of Art, Arizona State University in Tempe and his MFA from the San Francisco Art Institute. His work has been exhibited in 2005 in a one-person retrospective at the Smithsonian\'s National Museum of the American Indian in New York. Notable group exhibitions include: "Who Stole the Tee Pee?" at the National Museum of the American Indian, New York; "AlieNation" at the American Indian Community House Gallery. His work was recently shown at "IN/SIGHT 2010" at Chelsea Art Museum, New York and "The Importance of IN/VISIBILITY" at Abrazo Interno Gallery, New York, 2009. In 2002 Martinez was one of the first non-Japanese artists to be invited to exhibit at the Contemporary Artists Federation Group Show at the Museum of Modern Art, Saitama, Japan. In 2000, he was a visiting professor of art at the University of Arizona in Tucson, and in 2001 he received the Native Artist in Residence Fellowship from the National Museum of the American Indian. In 2005, Martinez completed a commission for the Heard Museum in Phoenix, Arizona; a 22-foot mural called "Sonoran Desert: Yaqui Home" as part of "Home: Desert Peoples in the Southwest" exhibition. Martinez will be featured in a solo exhibition at Mesa Contemporary Arts in Mesa, Arizona opening September 10, 2010.', 'title': 'Mario Martinez (painter)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Jeonju National Museum is a national museum located in Jeonju, Jeollabuk-do, South Korea. It opened on October 26, 1990 as the ninth South Korean national museum.', 'title': 'Jeonju National Museum'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Canadian NORAD Region (CANR) Forward Operating Locations (FOLs) were created under the North American Air Defence Modernization (NAADM) program authorized at the Shamrock Summit held in Quebec City on March 18, 1985. The locations are maintained by the Canadian Department of National Defence. The NAADM program was authorized by the Canada-United States Memorandum of Understanding signed by Prime Minister Mulroney and Ronald Reagan at the summit. The purpose of these upgraded facilities was to ensure adequate facilities existed for NORAD to defend the Northern Canadian frontier. Accommodations for up to six fighters in hangars were built, space for up to 200 support personnel, and storage facilities. Five locations were originally investigated, but only four locations were built.', 'title': 'Canadian NORAD Region Forward Operating Locations'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The National Museum in Kraków (Polish: "Muzeum Narodowe w Krakowie" ), popularly abbreviated as MNK, established in 1879, is the main branch of Poland\'s National Museum, which has several independent branches with permanent collections around the country. The Museum consists of 21 departments which are divided by art period; 11 galleries, 2 libraries, and 12 conservation workshops. It holds some 780,000 art objects, spanning from classical archeology to modern art, with special focus on Polish painting. <ref name="culture.pl/muzea"> </ref><ref name="muzeum/Zbiory"> </ref>', 'title': 'National Museum, Kraków'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"National Museum of Poland" is the common name for several of the country\'s largest and most notable museums. Poland\'s National Museum comprises several independent branches, each operating a number of smaller museums. The main branch is the National Museum in Kraków (Polish: "Muzeum Narodowe w Krakowie" ), established in 1879 with permanent collections consisting of several hundred thousand items – kept in big part at the Main Building (along the 3 Maja St.), but also in the eight of its divisions around the city.', 'title': 'National Museum of Poland'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Imperial War Museums (IWM) is a British national museum organisation with branches at five locations in England, three of which are in London. Founded as the Imperial War Museum in 1917, the museum was intended to record the civil and military war effort and sacrifice of Britain and its Empire during the First World War. The museum\'s remit has since expanded to include all conflicts in which British or Commonwealth forces have been involved since 1914. As of 2012, the museum aims "to provide for, and to encourage, the study and understanding of the history of modern war and \'wartime experience\'".', 'title': 'Imperial War Museum'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The Great War is a 26-episode documentary series from 1964 on the First World War. The documentary was a co-production of the Imperial War Museum, the British Broadcasting Corporation, the Canadian Broadcasting Corporation and the Australian Broadcasting Commission. The narrator was Michael Redgrave, with readings by Marius Goring, Ralph Richardson, Cyril Luckham, Sebastian Shaw and Emlyn Williams. Each episode is \u200940 minutes long.', 'title': 'The Great War (documentary)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Croatian Natural History Museum (Croatian: "Hrvatski prirodoslovni muzej" ) is the oldest and biggest natural history museum and the main body for natural history research, preservation and collection in Croatia. Located on Dimitrije Demeter Street in Gornji Grad, one of the oldest neighbourhoods of the Croatian capital Zagreb, it owns one of the biggest museum collections in Croatia, with over 2\xa0million artefacts, including over 1.1\xa0million animal specimens. It was founded in 1846 as the "National Museum". The National Museum was later split up into five museums, three of which were in 1986 merged as departments of the newly named Croatian Natural History Museum. The museum contains a large scientific library open to the public, and publishes the first Croatian natural history scientific journal, "Natura Croatica".', 'title': 'Croatian Natural History Museum'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Roadstar was a British rock band formed in 2002. The group originally went under the name Hurricane Party and disbanded in April 2007. A year later several of the members, together with Sid Glover, formed Heaven's Basement. In 2016, former band member Richie Hevanz became frontman of Fragile Things, following a short stint in a band called Endless Mile.", 'title': 'Roadstar'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Cult are a British rock band formed in 1983. Before settling on their current name in January 1984, the band performed under the name Death Cult, which was an evolution of the name of lead singer Ian Astbury\'s previous band Southern Death Cult. They gained a dedicated following in the UK in the mid-1980s as a post-punk/gothic rock band, with singles such as "She Sells Sanctuary", before breaking mainstream in the United States in the late 1980s as a hard rock band with singles such as "Love Removal Machine" and "Fire Woman". According to music critic Stephen Thomas Erlewine, the band fuse a "heavy metal revivalist" sound with the "pseudo-mysticism ... of The Doors [and] the guitar-orchestrations of Led Zeppelin ... while adding touches of post-punk goth rock". Since the initial formation of Southern Death Cult in Bradford in 1981, the band have had various line-ups; the longest-serving members are Astbury and guitarist Billy Duffy, the band\'s two songwriters.', 'title': 'The Cult'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Paul Newton (born 21 February 1948, Andover, Hampshire) is a British rock musician. He was bassist with progressive group "Shinn" which featured organist Don Shinn and drummer Brian "Blinky" Davison and then joined a reformed line-up of "The Gods" with Ken Hensley and Lee Kerslake. He was the original bass guitarist for Uriah Heep, and played on the band\'s first three albums. He subsequently played for a band called "Festival" for several years on the Mecca Palais circuit and also worked as a studio musician and appeared on various recordings. More recently he has performed with other ex-members of Uriah Heep (Ken Hensley, John Lawton & Lee Kerslake) in "Uriah Heep Legends" and continues to do this.Has recently appeared with "Behind Closed Doors, a band formed by son, Julian and was also a member of Ledbury rock band "The Rocking Aces" until they disbanded in December 2013. Currently working with singer/guiarist Chris Rainbow and with "The Business" plus session work for various bands/artistes. Newton/Rainbow Project CD "Licence to Rock" is now available through cdbaby.com.', 'title': 'Paul Newton (musician)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Fort Hope are a British rock band formed in 2013 after the disbandment of electronic rock band My Passion in 2012. The band has released three EPs and released their debut mini-album in May, which peaked at 8 on the UK top Rock and Metal albums.', 'title': 'Fort Hope'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Aaron Buchanan & The Cult Classics are a British rock band formed in 2016 by former Heaven\'s Basement vocalist of international acclaim (and Red Bull Records alumnus), Aaron Buchanan. Band members include Aaron Buchanan (vocals), Laurie Buchanan (guitar and vocals), Tom McCarthy (guitar), Chris Guyatt (bass) and Paul White (drums) (formally of industrial metal band The Defiled). The band cite 1990s grunge rock influences and came together for first rehearsals in June 2016 initially with Kev Hickman formally of RavenEye on drums, this was followed up with a full UK tour alongside InMe starting on 17 October 2016 through to 23 October in support of "The Man With Stars On His Knees" album.', 'title': 'Aaron Buchanan &amp; The Cult Classics'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': '"Lost!" is a song by the British rock band Coldplay. The band co-produced it with Brian Eno and Markus Dravs for their fourth album, "Viva la Vida or Death and All His Friends". The song was released on 10 November 2008 as the fourth overall single from the album to generally positive critical reviews. A live version was released via digital download following a performance of the band and Jay-Z at the 2009 Grammy Awards, spurring high digital sales and giving "Lost!" a new peak at number 40 in the United States.', 'title': 'Lost!'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Coldplay are a British rock band formed in 1996 by lead vocalist and keyboardist Chris Martin and lead guitarist Jonny Buckland at University College London (UCL). After they formed under the name Pectoralz, Guy Berryman joined the group as bassist and they changed their name to Starfish. Will Champion joined as drummer and backing vocalist, completing the lineup. Creative director Phil Harvey is often referred to as the fifth member by the band. The band renamed themselves "Coldplay" in 1998, before recording and releasing three EPs: "Safety" in 1998 and "Brothers & Sisters" and "The Blue Room" in 1999. "The Blue Room" was their first release on a major label, after signing to Parlophone.', 'title': 'Coldplay'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Progres 2 is an art rock band from Brno, Czech Republic. It was established in 1968, known as Progress Organization, by Zdeněk Kluka, Pavel Váně, Jan Sochor and Emanuel Sideridis. Its most important album in a Czech context was the rock opera project "Dialog s vesmírem" (Dialog with The Universe) in 1978, only a year after the transformation of the band called "Bardonaj" to the new band Progres 2. The public presentation of this rock opera was the first audiovisual program of rock music in Czechoslovakia, inspired by the British rock group Pink Floyd. Because this rock band played in the totalitarian state, they had a few troubles with officials. The best known problem was the one with lyrics of one song from the album "Dialog s vesmírem". The song was called "Planeta Hieronyma Bosche" (The Planet of Hieronymus Bosch) where the band sings about life on heroin. Censors forbade this song and the band solved it by using only the vowels from the original lyrics. At concerts they played the whole original lyrics.', 'title': 'Progres 2'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Girlschool are a British rock band that formed in the new wave of British heavy metal scene in 1978 and frequently associated with contemporaries Motörhead. They are the longest running all-female rock band, still active after more than 35 years. Formed from a school band called Painted Lady, Girlschool enjoyed strong media exposure and commercial success in the UK in the early 1980s with three albums of 'punk-tinged metal' and a few singles, but lost their momentum in the following years.", 'title': 'Girlschool'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Daniel Campbell "Dan" Smith (born 14 July 1986) is a British singer-songwriter and record producer. He is the lead singer, primary songwriter. and founder of the British rock band Bastille. The band formed in 2010 and gained mass popularity in 2013 when the song "Pompeii" was released. The band released their second album, "Wild World" in September 2016. .', 'title': 'Dan Smith (singer)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'BayArena (] ) is a football stadium in Leverkusen, North Rhine-Westphalia, Germany, which has been the home ground of Bundesliga club Bayer Leverkusen since 1958.', 'title': 'BayArena'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Sport plays a prominent role in Gibraltarian life. The range of sports practiced in the British overseas territory of Gibraltar is wide and varied in comparison to its size of less than 7 km2 . The Government of Gibraltar promotes sport within The Rock and supports many local sports associations financially. Gibraltar also competes in international sporting events, having competed in the Commonwealth Games since 1958, and in the biennial Island Games, which it hosted in 1995 and will host again in 2019.', 'title': 'Sport in Gibraltar'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Leverkusen – Cologne IV (German: "Leverkusen – Köln IV" ) is one of the four electoral districts (German: "Wahlkreis") covering the city of Cologne in the German Bundestag. Most of the electorate comes from the neighbouring city of Leverkusen. Part of the state of North Rhine-Westphalia, the constituency elects one representative under the mixed member proportional representation (MMP) system. Under the current constituency numbering system, it is designated as constituency 96. The district has been held by the Social Democratic Party of Germany (SPD) since it was created for the 2002 election, with Karl Lauterbach representing the district since the 2005 election.', 'title': 'Leverkusen – Cologne IV'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The 2017–18 Bayer 04 Leverkusen season is the 114th season in the football club's history and 39th consecutive and overall season in the top flight of German football, the Bundesliga, having been promoted from the 2. Bundesliga Nord in 1979. In addition to the domestic league, Bayer Leverkusen also are participating in this season's edition of the domestic cup, the DFB-Pokal. This is the 60th season for Leverkusen in the BayArena, located in Leverkusen, North Rhine-Westphalia, Germany. The season covers a period from 1 July 2017 to 30 June 2018.", 'title': '2017–18 Bayer 04 Leverkusen season'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Royal Moroccan Athletics Federation ("Fédération Royale Marocaine d’Athlétisme", FRMA) is Morocco\'s governing body for the sport of athletics. It was established in 1957 and has been affiliated to the International Association of Athletics Federations (IAAF) since 1958. It is also a member of the Confederation of African Athletics since 1973.', 'title': 'Royal Moroccan Athletics Federation'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The 1993 DFB-Pokal Final decided the winner of the 1992–93 DFB-Pokal, the 50th season of Germany's premier knockout football cup competition. It was played on 12 June 1993 at the Olympiastadion in Berlin. Hertha BSC's second team, playing in the third division, made it to the final against Bayer Leverkusen, making it the first and only time a reserve side has made it to the final, as second teams have since been disallowed from entering the competition. Leverkusen won the match 1–0 to claim their first cup title.", 'title': '1993 DFB-Pokal Final'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Robin Dutt (] ; born 24 January 1965) is a retired German football player, manager and currently board representative for sport of VfB Stuttgart. He was also the manager of Bundesliga side Werder Bremen and Bayer Leverkusen. Previously he coached SC Freiburg after taking over from the long-serving Volker Finke in July 2007. He had previously been manager of Stuttgarter Kickers for four years. Starting from the 2011–12 season, he signed a two-year managerial contract with Bayer Leverkusen after the previous manager Jupp Heynckes confirmed on 21 March 2011 that he would not be extending his stay at the BayArena.', 'title': 'Robin Dutt'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Bayer 04 Leverkusen Fußball GmbH, also known as Bayer 04 Leverkusen ] , Bayer Leverkusen, Leverkusen or simply Bayer, is a German football club based in Leverkusen, North Rhine-Westphalia. The club plays in the Bundesliga, the top tier of the German football league system, and hosts matches at the BayArena.', 'title': 'Bayer 04 Leverkusen'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The 1988 UEFA Cup Final was a football tie played on 4 May 1988 and 18 May 1988 between RCD Espanyol of Spain and Bayer 04 Leverkusen of West Germany. Leverkusen won 3–2 on penalties after 3–3 on aggregate.', 'title': '1988 UEFA Cup Final'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Essen Minster (German: Essener Münster ), since 1958 also Essen Cathedral (Essener Dom ) is the seat of the Roman Catholic Bishop of Essen, the "Diocese of the Ruhr", founded in 1958. The church, dedicated to Saints Cosmas and Damian and the Blessed Virgin Mary, stands on the Burgplatz in the centre of the city of Essen, Germany.', 'title': 'Essen Minster'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Kim Min-seok (born (1990--) 26, 1990 ), better known by his stage name Xiumin, is a South Korean singer and actor. He is best known as a member of the South Korean-Chinese boy group EXO, its sub-group EXO-M, and its sub-unit EXO-CBX.', 'title': 'Xiumin'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Exo (Korean: 엑소 ; stylized as EXO) is a South Korean-Chinese boy group based in Seoul. Formed by S.M. Entertainment in 2011, the group debuted in 2012 with twelve members separated into two subgroups, Exo-K (Suho, Baekhyun, Chanyeol, D.O., Kai, and Sehun) and Exo-M (Xiumin, Lay, Chen and former members Kris, Luhan and Tao ), performing music in Korean and Mandarin respectively. Exo\'s first album "XOXO" (2013), which contained the breakthrough hit "Growl", was a critical and commercial success, winning both Disk Daesang at the 28th Golden Disk Awards and Album of the Year at the 15th Mnet Asian Music Awards. It sold over one million copies, making Exo the best-selling Korean artist in twelve years. Subsequent albums and EPs continued with strong sales, and Exo were ranked the most influential celebrity by "Forbes" Korea Power Celebrity for the years 2014 and 2015. They have been named "the biggest boyband in the world" by media outlets.', 'title': 'Exo (band)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Kim Jong-in (born (1994--) 14, 1994 ), better known as Kai, is a South Korean singer and actor. He is a member of the South Korean-Chinese boy group EXO and its sub unit EXO-K.', 'title': 'Kai (entertainer, born 1994)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Exo Planet #3 – The EXO\'rDIUM is the third tour of South Korean-Chinese boy band EXO. The tour was officially announced on June 15, 2016 and began in Seoul\'s Olympic Gymnastics Arena on July 22, 2016. The first 6 dates were in South Korea, making EXO the first K-pop group to have the longest solo concert series in Seoul. During EXO\'s EXO\'rDIUM tour, member Kai struggled with an ankle injury, making him unable to fully participate in the first three months of the tour. In February 2017, official announcements were made to announce that promotions would continue in Mexico and the United States, marking the EXO\'rDIUm tour as EXO\'s second World Tour. It was announced on March 30, 2017 that the tour will conclude in Seoul with two encore performances on May 27 and 28, titled "Exo Planet #3 – The Exo\'rdium[dot]".', 'title': "Exo Planet 3 – The Exo'rdium"}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Park Chan-yeol (born November 27, 1992), better known by the mononym Chanyeol, is a South Korean rapper, singer, songwriter and actor. He debuted in 2012 as a member of the South Korean-Chinese boy group EXO and its sub-unit EXO-K.', 'title': 'Park Chanyeol'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Kim Jong-dae (born September 21, 1992), better known by his stage name Chen, is a South Korean singer-songwriter and actor. He is a member of the South Korean-Chinese boy group EXO and its sub-unit EXO-CBX, as well as S.M Entertainment's ballad group SM the Ballad.", 'title': 'Chen (singer)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Lu Han (born (1990--)20 1990 ), also known as Luhan, is a Chinese singer and actor. He was a member of the South Korean-Chinese boy group EXO and its sub-group EXO-M, before leaving the group in October 2014. That year, he was ranked the sixth most popular entertainment star in China by China National Radio.', 'title': 'Luhan (entertainer)'}
