[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Born in China (我們誕生在中國) is a 2016 nature documentary film directed by Lu Chuan. A co-production between Disneynature and Shanghai Media Group, the film was released in China on August 12, 2016 and in the United States on April 21, 2017, one day before Earth Day. The film focuses on a female snow leopard named Dawa and her cubs, a young golden snub-nosed monkey named Tao Tao, a female giant panda named Ya Ya along with her daughter Mei Mei, and a herd of chiru. The American release of the film is narrated by John Krasinski and the Chinese release is narrated by Zhou Xun.', 'title': 'Born in China'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Wu Weishan (; born: January 1962) is Curator of the National Art Museum of China,Vice-Chairman of the China Artists Association, President of the Chinese Academy of Sculpture and Director of the Academy of Fine Arts at Nanjing University. Wu has been actively promoting Chinese art on the world stage and has made great contribution to the international cultural exchange of China. He was awarded the First Award for Person of the Year in Art of P.R.C. in 2014 by RRC and was granted the title of “Artists with High Moral Virtue and Artistic Achievements of China” in 2015 and “Goodwill Ambassador for China Voices” by the State Council Information Office, P.R.C. in 2016.', 'title': 'Wu Weishan'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Pocahontas is a 1995 American animated musical romantic-comedy-drama film produced by Walt Disney Feature Animation for Walt Disney Pictures. The 33rd Disney animated feature film, the film is part of the era known as the Disney Renaissance which lasted from 1989 to 1999. Directed by Mike Gabriel and Eric Goldberg, the film is inspired by the known history and folklore surrounding the Native American woman Pocahontas and portrays a fictionalized account of her historical encounter with Englishman John Smith and the Jamestown settlers that arrived from the Virginia Company. The voice cast features Irene Bedard, Mel Gibson, David Ogden Stiers, Russell Means, Christian Bale, Billy Connolly, and Linda Hunt. The musical score was written by Alan Menken, with songs written by Menken and lyricist Stephen Schwartz.', 'title': 'Pocahontas (1995 film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Japanese Buddhist architecture is the architecture of Buddhist temples in Japan, consisting of locally developed variants of architectural styles born in China. After Buddhism arrived the continent via Three Kingdoms of Korea in the 6th century, an effort was initially made to reproduce original buildings as faithfully as possible, but gradually local versions of continental styles were developed both to meet Japanese tastes and to solve problems posed by local weather, which is more rainy and humid than in China. The first Buddhist sects were Nara's six Nanto Rokushū (南都六宗 , Nara six sects ) , followed during the Heian period by Kyoto's Shingon and Tendai. Later, during the Kamakura period, in Kamakura were born the Jōdo and the native Japanese sect Nichiren-shū. At roughly the same time Zen Buddhism arrived from China, strongly influencing all other sects in many ways, including architecture. The social composition of Buddhism's followers also changed radically with time. In the beginning it was the elite's religion, but slowly it spread from the noble to warriors, merchants and finally to the population at large. On the technical side, new woodworking tools like the framed pit saw and the plane allowed new architectonic solutions.", 'title': 'Japanese Buddhist architecture'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Liu Zhenhua (; born 1921) is a People's Liberation Army general (shang jiang). He was born in Tai'an, Shandong Province. He joined the Communist Party of China in 1938. He was a veteran of the Second Sino-Japanese War, Chinese Civil War and Korean War. He made significant contributions to the victories of the Battle of Jinzhou against Kuomintang forces of Liao Yaoxiang and the Pingjin Campaign against Kuomintang forces of Fu Zuoyi. He was an alternate member of the 9th Central Committee of the Communist Party of China and a delegate to the 8th National People's Congress. In 1964, he was promoted to major general. He was Ambassador of China to Albania from 1971 to 1976. As Ambassador, he made improvement to China–Greece relations by establishing diplomatic relations with Greece on June 6, 1972. In March 1979, he was made deputy political commissar of the Shenyang Military Region and political commissar of the Shenyang Military Region in October 1982. In 1987 he was transferred to the Beijing Military Region as its political commissar, holding that post until 1990. During his tenure in Beijing, he received his current rank of Shang Jiang in 1988.", 'title': 'Liu Zhenhua'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Li Zhusheng () (1903–1973), also known as Li Mengda (), alias Yu Qiquan (), was a member of the 28 Bolsheviks. He was born in Anhui Province. In 1925, he left Anqing for the Soviet Union, where he studied at Moscow Sun Yat-sen University. In January 1931, he returned to China and went to Shanghai. On June 26, 1934, he was arrested by the Kuomintang secret police, and while imprisoned, betrayed other members of the Communist Party of China, including Sheng Zhongliang, another member of the 28 Bolsheviks who he had been classmates with in Moscow. In January 1935, he was given a position as a Russian language translator on the behalf of the CC Clique. In 1939, he was made a formal member of the Kuomintang. In 1948, he was made head Russian translator in Shanghai. In March 1951, he was arrested by the People's Republic of China police and brought to Beijing, where he was imprisoned in Qincheng Prison. He died of old age in prison.", 'title': 'Li Zhusheng'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Adam Tsuei (; born October 26, 1959) is an entrepreneur, film producer, and director. He was the former president of Sony Music Entertainment in the Greater China Region. He has made and brought to the music world super idols as Jay Chou, Leehom Wang, F4 and Jolin Tsai, which made him been viewed as one of the most powerful masters behind the scene in entertainment industry. In 2011, he successfully marketed the film "You Are the Apple of My Eye", a movie featuring a love story within a group of boys and a girl, which made a great hit among all Chinese-speaking countries. Decided to dedicating to movie industry, Tsuei founded Amazing Film Studio in 2012 and served as CEO. In 2013, by putting effort into producing, marketing and distributing, he presented the film" Tiny Times" and "Tiny Times 2". Both of them quickly becomes the hottest topics among mainland China, Taiwan and Hong Kong. In 2014, with the same legend combination of Angie Chai and Giddens Ko, he presented" Café. Waiting. Love", a romantic comedy with color of fantasy inside. In the future of 2016, as a director and producer, Tsuei is going to present the film “The Tenants Downstairs”, adapted by Giddens Ko’s original novel. There will be a film with black humor, fantasy, mystery and thriller in. With the experience of being a professional manager in global enterprise for decades, Tsuei is aimed for building a total entertainment company for Greater China, including movie’s production, movie’s promotion, VFX, artist agency, music production and concert production.', 'title': 'Adam Tsuei'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Li Chengpeng () (born September 22, 1968) is a prominent writer and social critic in the People's Republic of China. Well known in China for his reportage and social commentary—Li's Sina Weibo blog had nearly six million followers — (it is offline now) Li made international headlines in 2011 when he announced that he would seek political office as an independent candidate in his hometown of Chengdu, Sichuan province. While not technically illegal, the decision represented a rare and bold move in a country where candidates for political office are typically appointed by the Communist Party of China.", 'title': 'Li Chengpeng'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Sun Chunlan (; born May 1950) is a Chinese politician. She currently serves as the Head of the United Front Work Department of the Central Committee of the Communist Party of China, and is a member of the Politburo of the Communist Party of China. From 2009 to 2014, Sun served in two prominent regional posts, first as Communist Party Secretary of Fujian province, then Party Secretary of Tianjin, one of China's four direct-controlled municipalities. Her tenure in Fujian made her the second female provincial-level party chief since the founding of the People's Republic of China in 1949 (the first was Wan Shaofen).", 'title': 'Sun Chunlan'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'British actor Christian Bale has starred in various films, as well as advertisements and a video game. He made his acting debut in 1986, on the television film "". The following year, he made his film debut starring alongside John Malkovich and Miranda Richardson in the war film "Empire of the Sun". Bale\'s role of a young boy, interned in China by the Japanese, received praise from most film critics. Two years later, Bale had a minor role in "Henry V", a drama film based on William Shakespeare\'s play "The Life of Henry the Fifth". It has been considered one of the best Shakespeare film adaptations ever made. In 1992, Bale starred as Jack Kelly in the Walt Disney musical drama "Newsies", which was a critical and commercial failure; however, it gained a cult following. He received a role in the 1994 drama "Little Women", which garnered positive reviews. Bale lent his voice for the Disney animated film "Pocahontas" in 1995, although it received a mixed reception and attained box office success. He starred as British journalist Arthur Stuart in the Todd Haynes-directed drama "Velvet Goldmine" (1998). Although critics were divided on the film, Bale\'s role was "eagerly anticipated". Bale portrayed Demetrius in the critically praised 1999 film "A Midsummer Night\'s Dream", an adaptation of Shakespeare\'s play of the same name, directed by Michael Hoffman. The same year, he portrayed Jesus of Nazareth in the television movie "Mary, Mother of Jesus".', 'title': 'Christian Bale filmography'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"A Star Is Born Again" is the 13th episode from "The Simpsons"<nowiki>\'</nowiki> fourteenth season. It first aired on the Fox network in the United States on March 2, 2003. The episode owes much of its plot to "Notting Hill" (1999). While that film is about an actress (Julia Roberts) finding happiness with the owner of an independent bookstore, the Simpsons episode features Hollywood movie star Sara Sloane (Marisa Tomei) falling for Ned Flanders after visiting the Leftorium.', 'title': 'A Star Is Born Again'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The following is a list of comic book series based on the animated TV show The Simpsons and published by Bongo Comics in the United States. The first comic strips based on "The Simpsons" appeared in 1991 in the magazine "Simpsons Illustrated" (not to be confused with the comic publications from 2012 bearing the same name), which was a companion magazine to the show. The comic strips were popular and a one-shot comic book entitled "Simpsons Comics and Stories", containing three different stories, was released in 1993 for the fans. The book was a success and due to this, the creator of "The Simpsons", Matt Groening, and his companions Bill Morrison, Mike Rote, Steve Vance and Cindy Vance created the publishing company Bongo Comics. By the end of 1993, Bongo was publishing four titles: "Simpsons Comics", "Bartman", "Radioactive Man" and "Itchy & Scratchy Comics". Since then, many more titles have been published, out of which "Simpsons Comics", "Bart Simpson", "Bart Simpson\'s Treehouse of Horror", "Simpsons Super Spectacular", Simpsons Summer Shindig, and "Simpsons Winter Wingding".', 'title': 'List of The Simpsons comics'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"You Kent Always Say What You Want", formerly known as "Kent State Massacre", is the twenty-second episode of "The Simpsons"<nowiki>\'</nowiki> eighteenth season. It originally aired on the Fox network in the United States on May 20, 2007 as part of the one-hour season finale, alongside the episode "24 Minutes"; a repeat took place on August 19, 2007. It was the milestone 400th episode of "The Simpsons" and was written by Tim Long. The episode guest starred Ludacris as himself and Maurice LaMarche as the Fox announcer. It was the last episode to air prior to "The Simpsons Movie" releasing into theaters on July 27, 2007.', 'title': 'You Kent Always Say What You Want'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': '"The Simpsons"\' twenty-third season began airing on Fox on September 25, 2011, and ended May 20, 2012. The showrunner for the season was Al Jean, with three episodes ran with Matt Selman, one of those he also wrote himself. The show\'s 500th episode, "At Long Last Leave", aired February 19, 2012.', 'title': 'The Simpsons (season 23)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"The Itchy & Scratchy & Poochie Show" is the fourteenth episode in the eighth season of the American animated television series "The Simpsons". It originally aired on the Fox network in the United States on February 9, 1997. In the episode, "The Itchy & Scratchy Show" attempts to regain viewers by introducing a new character named Poochie, whose voice is provided by Homer. The episode is largely self-referential and satirizes the world of television production, fans of "The Simpsons", and the series itself. It was written by David X. Cohen and directed by Steven Dean Moore. Alex Rocco is a credited guest voice as Roger Meyers, Jr. for the third and final time (having previously provided the character\'s voice in "Itchy & Scratchy & Marge" and "The Day the Violence Died"); Phil Hartman also guest stars as Troy McClure. Poochie would become a minor recurring character and Comic Book Guy\'s catchphrase, "Worst episode ever", is introduced in this episode. With "The Itchy & Scratchy & Poochie Show", the show\'s 167th episode, "The Simpsons" surpassed "The Flintstones" in the number of episodes produced for a prime-time animated series.', 'title': 'The Itchy &amp; Scratchy &amp; Poochie Show'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"Little Orphan Millie" is the sixth episode of "The Simpsons"<nowiki>\'</nowiki> nineteenth season. It first aired on the Fox network in the United States on November 11, 2007. This episode represents a milestone in Simpsons\' history as it sees Kirk and Luann remarry after initially divorcing eleven seasons earlier. It was written by Mick Kelly, production assistant to Al Jean, and directed by Lance Kramer. During its first broadcast, the episode garnered 10.57 million viewers.', 'title': 'Little Orphan Millie'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Good Night" (also known as "Good Night Simpsons") is the first of forty-eight Simpsons shorts that appeared on the variety show "The Tracey Ullman Show". It originally aired on the Fox network in the United States on April 19, 1987, during the third episode of "The Tracey Ullman Show" and marks the first appearance of the Simpson family\xa0— Homer, Marge, Bart, Lisa, and Maggie\xa0— on television. After three seasons on Tracey Ullman, the shorts would be adapted into the animated show "The Simpsons". "Good Night" has since been aired on the show in the episode "The Simpsons 138th Episode Spectacular" (in its entirety), along with several other Ullman shorts, and is one of the few shorts to ever be released on DVD, being included in the Season 1 DVD set.', 'title': 'Good Night (The Simpsons short)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"The Simpsons 138th Episode Spectacular" is the tenth episode of "The Simpsons"<nowiki>\'</nowiki> seventh season. It originally aired on the Fox network in the United States on December 3, 1995. As the title suggests, it is the 138th episode and the third clip show episode of "The Simpsons", after "" and "Another Simpsons Clip Show". While the "138th Episode Spectacular" compiles sequences from episodes throughout the entire series like the previous two, it also shows clips from the original Simpsons shorts from "The Tracey Ullman Show" and other previously unaired material. Like the Halloween specials, the episode is considered non-canon and falls outside of the show\'s regular continuity.', 'title': 'The Simpsons 138th Episode Spectacular'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Patty and Selma Bouvier ( ) are fictional characters in the American animated sitcom "The Simpsons". They are identical twins (but with different hairstyles) and are both voiced by Julie Kavner. They are Marge Simpson\'s older twin sisters, who both work at the Springfield Department of Motor Vehicles, and possess a strong dislike for their brother-in-law, Homer Simpson. Selma is the elder by two minutes, and longs for male companionship while her sister, Patty, is a lesbian. Kavner voices them as characters who "suck the life out of everything". Patty and Selma first appeared on the first ever aired Simpsons episode "Simpsons Roasting On An Open Fire", which aired on December 17, 1989.', 'title': 'Patty and Selma'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': '"At Long Last Leave" is the fourteenth episode of "The Simpsons"\' twenty-third season, and the 500th episode overall of the series. In the episode, the Simpsons discover that the inhabitants of Springfield have grown tired of them and have secretly decided to throw them out of the city. After being evicted from Springfield, the family members end up in a rugged place without rules and regulations called The Outlands. There, they briefly come across their neighbor Julian Assange, who created WikiLeaks. Assange, who is in fear of extradition to Sweden and then the United States, guest-starred in the episode as himself and recorded his lines over the phone having been granted asylum in the Ecuadorian embassy in Britain, while waiting for the results of "Assange v Swedish Prosecution Authority".', 'title': 'At Long Last Leave'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Dan Frawley (1882–1967) was a pioneer Australian rugby league footballer, a national representative player. He played his career as a winger with the Eastern Suburbs club in Sydney and is considered one of the nation\'s finest footballers of the 20th century. A fast and agile winger, with an ability to effortlessly change direction, Frawley was at club and representative levels generally positioned on the outside of rugby league Immortal Dally Messenger, creating a formidable combination. He was a noted speedster who, on the 1908–09 Kangaroo tour of Great Britain, was acclaimed as the "100 yards champion" of the squad.', 'title': 'Dan Frawley'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Bryan Berry Helmer (born July 15, 1972) is a former professional ice hockey player. He is currently the VP of Hockey Operations with the Hershey Bears of the American Hockey League (AHL). He previously served as an assistant coach with the Bears and the Peterborough Petes of the Ontario Hockey League (OHL). A veteran of over 1,000 AHL and IHL games, Helmer previously served as captain for the Hershey Bears in the American Hockey League (AHL). He has also played in the National Hockey League (NHL) with the Phoenix Coyotes, St. Louis Blues, Vancouver Canucks and the Washington Capitals.', 'title': 'Bryan Helmer'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'William Daniel Frawley (born June 2, 1962) is a Canadian retired professional ice hockey player. During his junior hockey years, Frawley played for the Sudbury Wolves of the OHA and the Cornwall Royals of the QMJHL, before being drafted by the Chicago Black Hawks, 204th overall in the 1980 NHL Entry Draft. Frawley spent most of the next two years playing in the AHL.', 'title': 'Dan Frawley (ice hockey)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Donald "Nipper" O\'Hearn (February 14, 1928 – January 25, 2015) was a Canadian professional ice hockey goaltender who played over 200 games combined in the Pacific Coast Hockey League, United States Hockey League, American Hockey League, Maritime Major Hockey League, Quebec Hockey League, International Hockey League, and Eastern Hockey League. He was born in Halifax, Nova Scotia and raised in St. Catharines, Ontario. He died after a long illness in a hospital at St. Catharines in 2015.', 'title': "Don O'Hearn"}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "The Philadelphia Arrows were a professional ice hockey team that played in Philadelphia, Pennsylvania. Founded in 1927, the club was Philadelphia's first professional hockey team and played in the Canadian-American Hockey League. The team changed its name to the Philadelphia Ramblers beginning with the 1935-36 season when it became affiliated with the NHL New York Rangers. The following season and Ramblers and the C-AHL began playing an interlocking schedule with the International Hockey League for two seasons before the two circuits formally merged to form a new International American Hockey League (renamed the American Hockey League in 1940) in June, 1938. (The Ramblers continued to play in this league until folding in 1941.)", 'title': 'Philadelphia Arrows'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Robert James Sullivan (born November 29, 1957) is a retired professional ice hockey player who played 62 games in the National Hockey League. He played for the Hartford Whalers. Prior to joining the NHL, Sullivan played in the American Hockey League and International Hockey League, winning the Dudley "Red" Garrett Memorial Award as the rookie of the year in the American Hockey League in 1981–82.', 'title': 'Bob Sullivan (ice hockey)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Marcel Cousineau (born April 30, 1973) is a retired professional ice hockey player who played 26 games in the National Hockey League. He was selected by Boston Bruins in third round of the NHL draft. As a rookie, he was named to the Quebec Major Junior Hockey League All-Rookie Team. He also played professionally for the Toronto Maple Leafs (1996–98), New York Islanders (1998–99), Los Angeles Kings (1999-2000). Between his starts in the NHL he played stints in the minors (American Hockey League, International Hockey League, Quebec Senior Hockey League, Ligue Nord-Américaine de Hockey) and overseas Russia (Kontinental Hockey League):', 'title': 'Marcel Cousineau'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The American Hockey League is a minor professional ice hockey league in the United States and Canada. It serves as the top developmental league for the National Hockey League. The league played its first season in 1936 as the International-American Hockey League, a "circuit of mutual convenience" formed when the Northeast-based Canadian-American Hockey League and the Midwest-based International Hockey League agreed to play an interlocking schedule. After two seasons, the leagues formally merged into a unified league under the I-AHL name. After the 1939–40 season, the league became known as the American Hockey League.', 'title': 'List of AHL seasons'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The American Hockey League (AHL) is a 30-team professional ice hockey league based in the United States and Canada that serves as the primary developmental league for the National Hockey League (NHL). Since the 2010–11 season, every team in the league has an affiliation agreement with one NHL team. When NHL teams do not have an AHL affiliate, players are assigned to AHL teams affiliated with other NHL teams. Twenty-six AHL teams are located in the United States and the remaining four are in Canada. The league offices are located in Springfield, Massachusetts, and its current president is David Andrews.', 'title': 'American Hockey League'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "John Torchetti (born July 9, 1964) is a former American ice hockey player, and current assistant coach for the Detroit Red Wings of the National Hockey League (NHL). Torchetti previously served as the head coach for the San Antonio Rampage of the American Hockey League (2002–2003), the Moncton Wildcats of the QMJHL (2006–2007), the Iowa Wild of the American Hockey League (2014–2016), and interim head coach of the Minnesota Wild of the National Hockey League (2016). He also served as an assistant coach with the Tampa Bay Lightning, Atlanta Thrashers, and Chicago Blackhawks; Kontinental Hockey League's HC CSKA Moscow. Torchetti was also the interim head coach for the Florida Panthers, and the Los Angeles Kings.", 'title': 'John Torchetti'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The "Rock Band" Network in the music video games "Rock Band 2" and "Rock Band 3" supports downloadable songs for the Xbox 360, PlayStation 3, and Wii veins throughout the consoles\' respective online services. The Rock Band Network Store became publicly available on March 4, 2010 for all Xbox 360 players in selected countries (US, Canada, UK, France, Italy, Germany, Spain, Sweden, and Singapore). Rock Band Network songs became available on the PlayStation 3 in five song intervals through their own Rock Band Network Store on April 22, 2010. Starting on April 12, 2011, up to 10 songs were added weekly to the PlayStation 3 platform until June 14, 2011 when it reverted to five song intervals. Also, starting on June 14, 2011, PlayStation 3 Rock Band Network songs will only be compatible with Rock Band 3. Rock Band Network became available on the Wii in six to 10 song intervals from September 7, 2010 to January 18, 2011. Rock Band Network songs will be exclusive to the Xbox 360 for 30 days, after which a selection of songs will be made available on the PlayStation 3 and Wii. As of January 18, 2011, no further Rock Band Network songs will be released on the Wii platform due to Nintendo\'s small online install base, limited demand for the songs and the significant amount of work each song needs to convert to the Wii.', 'title': 'List of Rock Band Network songs'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Siren: Blood Curse, known in Japan as Siren: New Translation (サイレン:ニュー トランスレーション , Sairen:Nyū Toransurēshon ) , is a survival horror stealth game and the third installment in the "Siren" game series. Developed for the PlayStation 3 by Project Siren, a development team of SCE Japan Studio, and published by Sony Computer Entertainment, "Blood Curse" first became available in Japan for the PlayStation 3 on July 24, 2008 whilst it became available on the PlayStation Store in North America and Europe on exactly the same date. It later became available on the PlayStation Store in Australia on October 29, 2008 and for the PlayStation 3 one day later in the same country. It became available for the PlayStation 3 in Europe on October 31, 2008 and on the PlayStation Store in Japan on December 11, 2008.', 'title': 'Siren: Blood Curse'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Thatgamecompany, LLC (stylized as thatgamecompany) is an American independent video game development company co-founded by University of Southern California students Jenova Chen and Kellee Santiago in 2006. The company was a developer for Sony Computer Entertainment, contracted to create three downloadable games for the PlayStation 3\'s PlayStation Network service, and has since secured independent funding. The first of their games is a remake of Chen\'s award-winning Flash title "Flow", with enhanced visuals and sound, added multiplayer modes and compatibility with the PlayStation 3\'s motion sensitive controller. The title was released on the PlayStation Store in 2007. The company\'s second PlayStation 3 game, "Flower", was released on the PlayStation Store in 2009, and their third game, "Journey", was released in March 2012 on the PlayStation Store. Their fourth game, "Sky", is currently planned for a winter 2017 release, with a timed exclusive on iOS devices.', 'title': 'Thatgamecompany'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Entwined is a rhythm game developed by PixelOpus, a studio which consists of former game design students and is part of SCE Worldwide Studios, for the PlayStation 4, PlayStation 3 and PlayStation Vita. The game was announced at Sony\'s E3 media briefing on June 9, 2014 and was released worldwide on the PlayStation Store for the PlayStation 4 on the same day. The PlayStation 3 and PlayStation Vita version were released approximately a month later, and since "Entwined" is a cross-buy title, these two versions are available at no extra cost for anyone who has purchased the PlayStation 4 version.', 'title': 'Entwined (video game)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Zen Pinball is a series of pinball machine video games for iOS and the PlayStation 3 developed by Zen Studios. The iOS releases are two separate applications, each containing one table; Zen Pinball: Rollercoaster, released July 7, 2008, and Zen Pinball: Inferno, released October 31, 2008. "Zen Pinball" for the PlayStation 3 was published by Sony Computer Entertainment and features four tables, plus an additional six tables as downloadable content. It was released on the PlayStation Network on May 14, 2009. It is the PlayStation 3 counterpart to the "Pinball FX" series on the Xbox 360, and the first pinball game on the PlayStation 3. The game was also released on Android devices as Zen Pinball THD on December 1, 2011, and the Nintendo 3DS as Zen Pinball 3D via the Nintendo eShop on December 1, 2011 in Europe and January 12, 2012 in North America.', 'title': 'Zen Pinball'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Killzone is a first-person and twin sticks shooter series of video games exclusively for Sony Computer Entertainment\'s (SCE) video game consoles. The main series and the PlayStation Portable (PSP) installment were developed by Guerrilla Games, a subsidiary of SCE, and the PlayStation Vita installment was developed by Guerrilla Cambridge in the United Kingdom. "Killzone" currently consists of six games spanning over the PlayStation 2, PlayStation Portable, PlayStation 3, PlayStation Vita, and the PlayStation 4. The series began on the PlayStation 2 in November 2004 with "Killzone", and continued on the PlayStation Portable in October 2006 with "". " Killzone 2" was released for the PlayStation 3 in February 2009 , and "Killzone 3" was released in February 2011 , also for the PlayStation 3. "" was released for the PlayStation Vita in September 2013, followed by "Killzone Shadow Fall", a launch title for the PlayStation 4, in November 2013.', 'title': 'Killzone (series)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "The PlayStation 3 (PS3) is a home video game console developed by Sony Interactive Entertainment. It is the successor to PlayStation 2, and is part of the PlayStation brand of consoles. It was first released on November 11, 2006, in Japan, November 17, 2006, in North America, and March 23, 2007, in Europe and Australia. The PlayStation 3 mainly competes against consoles such as Microsoft's Xbox 360 and Nintendo's Wii as part of the seventh generation of video game consoles.", 'title': 'PlayStation 3'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Marvel Pinball is an arcade pinball video game developed by Zen Studios. It features Marvel Comics-themed pinball tables. It is available as a standalone game for the PlayStation 3 via the PlayStation Network, and as downloadable content for "Pinball FX 2" on the Xbox 360 via Xbox Live Arcade. Its content on the PlayStation 3 is also playable in "Zen Pinball 2". It is the second pinball title for the PlayStation 3, succeeding "Zen Pinball". It was released on December 8, 2010 on the Xbox 360 and December 14, 2010 on the PlayStation 3.', 'title': 'Marvel Pinball'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The "Rock Band" Network in the music video games "Rock Band 2" and "Rock Band 3" supports downloadable songs for the Xbox 360, PlayStation 3, and Wii versions through the consoles\' respective online services. The Rock Band Network Store became publicly available on March 4, 2010 for all Xbox 360 players in selected countries (US, Canada, UK, France, Italy, Germany, Spain, Sweden, and Singapore). Rock Band Network songs became available on the PlayStation 3 in five song intervals through their own Rock Band Network Store on April 22, 2010. Starting on April 12, 2011, up to 10 songs were added weekly to the PlayStation 3 platform until June 14, 2011 when it reverted to five song intervals. Also, starting on June 14, 2011, PlayStation 3 Rock Band Network songs will only be compatible with Rock Band 3. Rock Band Network became available on the Wii in six to 10 song intervals from September 7, 2010 to January 18, 2011. Rock Band Network songs will be exclusive to the Xbox 360 for 30 days, after which a selection of songs will be made available on the PlayStation 3 and Wii. As of January 18, 2011, no further Rock Band Network songs will be released on the Wii platform due to Nintendo\'s small online install base, limited demand for the songs and the significant amount of work each song needs to convert to the Wii.', 'title': 'List of Rock Band Network 1.0 songs'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Ratatouille is a video game based on the Pixar film of the same name. It was developed at Heavy Iron Studios and released by THQ, on June 26, 2007. "Ratatouille" was released on thirteen systems—Wii, Nintendo DS, PlayStation 3, PlayStation 2, PSP, Xbox 360, Xbox, Nintendo GameCube, Game Boy Advance, Microsoft Windows, OS X, J2ME, and mobile phone.', 'title': 'Ratatouille (video game)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The first contribution of Julius Roden in the world of independent cinema was the old school horror movie Kasambahay (The Dead's Grin), - released in 2008 at the U.P. Film Institute.", 'title': 'Julius Roden'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Kotodama – Spiritual Curse (学校の怪談\u3000呪いの言霊 , Gakkō no Kaidan Noroi no Kotodama ) is a 2014 Japanese school horror film written and directed by Masayuki Ochiai and based on "Gakkō no Kaidan". The main cast includes the five members of the Japanese idol girl group Tokyo Girls\' Style. The film was released on May 23, 2014.', 'title': 'Kotodama – Spiritual Curse'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Togusa (Japanese: トグサ ) is the second most prominently featured male character in Masamune Shirow\'s "Ghost in the Shell" manga and anime series. In "", as well as the original "Ghost in the Shell" film, it is stated that he is the youngest member of Section 9 and the only family man. His voice is provided by Kōichi Yamadera in most of his Japanese-speaking appearances, while Hirotaka Suzuoki provides his voice in the "Ghost in the Shell" PlayStation game. In the film\'s English dub he is voiced by Christopher Joyce, while Crispin Freeman performs his voice in the English dub of the TV series and the English dub of "".', 'title': 'Togusa'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Crimson Ghost is a 1946 Republic film serial directed by Fred C. Brannon and William Witney with Charles Quigley and Linda Stirling playing the leads. This was Witney\'s last serial, after a career that left him one of the most praised of all serial directors. The serial was re-released as a six-episode television series in the 1950s and as a television film called Cyclotrode "X" in 1966. In the 1990s "The Crimson Ghost" was one of only two Republic serials to be colorised. The villain of the serial, the Crimson Ghost of the title, is one of the most visually striking of the medium. The horror punk band Misfits adapted his visage as their skull logo, and he has appeared in the music video for the song "The Number of the Beast" by Iron Maiden.', 'title': 'The Crimson Ghost'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Puzzle (パズル ) is a 2014 Japanese school horror film directed by Eisuke Naito and based on the novel by Yusuke Yamada. It was released on March 8, 2014.', 'title': 'Puzzle (2014 film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'School Ghost Stories (学校の怪談 , Gakkō no Kaidan ) is a 1995 Japanese film directed by Hideyuki Hirayama. The film is the first of the "School Ghost Stories" features, and was followed by "School Ghost Stories 2" in 1996.', 'title': 'School Ghost Stories'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Whispering Corridors (; also known as Ghost School and Ghost School Horror) is a South Korean horror film series. The series uses an all-girls high school as the backdrop for each of its films and doesn\'t share a continuing plot. Every "Whispering Corridors" film features a different plot, characters and settings. The series is notable for helping generate the explosion of the New Korean Wave cinematic movement, and dealing with taboo topics such as authoritarianism in the harsh South Korean education system, gay relationships and teen suicide, following the liberalization of censorship.', 'title': 'Whispering Corridors (film series)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ghost Banana Tree (Cambodian title: "Khmoach Daoem Chek Chvia", Khmer: ខ្មោចដើមចេកជ្វា ) is a 2005 film. It is a successful Cambodian horror film based on a Cambodian ghost story about a vengeful ghost woman haunting a banana tree and killing her husband. It\'s the fourth successful horror film by Campro production, following "ang Neath", "The Forest" and "The Haunted House".', 'title': 'Ghost Banana Tree'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Cha Ye-ryun (born Park Hyun-Ho on July 16, 1985) is a South Korean actress. A graduate of Sangmyung High School, she began acting in 2005 at the age of 20, when she had a supporting role in the horror film Voice. In 2007, she made her official television debut as one of the main cast members in the melodrama Bad Love. Cha played her first leading role in the 2014 romantic-comedy film The Actress Is Too Much.', 'title': 'Cha Ye-ryun'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Voice ( also known as Whispering Corridors 4: Voice and Voice Letter) is a 2005 South Korean horror film, and the fourth installment of the "Whispering Corridors" film series. This film was the debut film for its three young actresses, as well as director Choi Ik-Hwan, who had served as an assistant director on the first film of the series.', 'title': 'Voice (film)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The D Las Vegas Casino Hotel is a 34-story, 638-room hotel and casino in Downtown Las Vegas Nevada, owned and operated by Derek and Greg Stevens.', 'title': 'The D Las Vegas'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Señorita México was the name of a national beauty pageant in Mexico, celebrated since 1952. After 2005, the pageant changed its name to "Miss Mexico". From 1952 to 1994, was the official pageant responsible for sending the country\'s representatives to the Miss Universe, Miss World, Miss International and other international pageants. After the crowning of Lupita Jones, as the country\'s first Miss Universe, a dispute between Miss Jones and the pageant organizers over overdued prizes, led to a break of the longtime association between the pageant and the broadcast network Televisa. When the pageant moved to another network TV Azteca, a competing pageant called "Nuestra Belleza México" was created, later directed by Miss Jones with the sponsorship of the Televisa TV Network. in 1994 Señorita México lost the bid to Nuestra Belleza México to be the official pageant for the Miss Universe pageant. Later Nuestra Belleza México also obtained the rights of sending Mexico\'s representatives to Miss World and Miss International. However, the "Miss Mexico" pageant still sends representatives to other international pageants. The trade name Señorita Mexico was trademarked in the United States, by Venezuelan Entrepreneur Adan S. Perez CEO of The Miss Mexico Organization with headquarters in Las Vegas Nevada who produces The Señorita Mexico U.S. beauty pageant. He developed a franchise system in every state of The Union to bring girls from all over the United States to compete in national beauty event which takes place every year in Las Vegas. Adan Perez has been producing the national competition Señorita Mexico U.S in Las Vegas, since the year of 2003.', 'title': 'Señorita México'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Las Vegas Stadium is the working name for a domed stadium under construction in Paradise, Nevada for the Las Vegas Raiders of the National Football League (NFL) and the UNLV Rebels football team from the University of Nevada, Las Vegas (UNLV). It is located on about 62 acres west of Mandalay Bay at Russell Road and Hacienda Avenue and between Polaris Avenue and Dean Martin Drive, just west of Interstate 15. Construction of the $1.9 billion stadium began in September 2017 and is expected to be completed in time for the 2020 NFL season.', 'title': 'Las Vegas Stadium'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "The Oakland Raiders relocation to Las Vegas was a successful effort by the owner of the Oakland Raiders (Mark Davis) to relocate the American football club from its current and longtime home of Oakland, California to Las Vegas, Nevada. The team is scheduled to begin play as the Las Vegas Raiders for the 2020 National Football League (NFL) season (although a move to Las Vegas could happen as soon as 2019 with Sam Boyd Stadium), playing home games at the Las Vegas Stadium. NFL team owners voted 31–1 to approve the move, which was announced at the annual league meetings in Phoenix, Arizona on March 27, 2017. The Raiders became the third NFL franchise to relocate in the 2010s, following the Rams' move from St. Louis, Missouri to Los Angeles, California on January 12, 2016, and the Chargers' move from San Diego, California to Los Angeles on January 12, 2017. The Raiders' move to Las Vegas comes after years of failed efforts to renovate or replace the Oakland–Alameda County Coliseum, which has been rated by multiple sources as one of the worst stadiums in the NFL.", 'title': 'Oakland Raiders relocation to Las Vegas'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Air Vegas (IATA: 6V,\xa0ICAO: VGA,\xa0Call sign: Air Vegas) was an airline with its headquarters on the grounds of the North Las Vegas Air Terminal in North Las Vegas, Nevada. It operated daily sightseeing flights from Las Vegas to the Grand Canyon. Prior to moving to the North Las Vegas Airport its main bases were McCarran International Airport (LAS), Las Vegas and Henderson Executive Airport (HND), Las Vegas.', 'title': 'Air Vegas'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Las Vegas Uncork\'d (also referred to as Vegas Uncork\'d and Vegas Uncorked) is an annual culinary and wine event in Las Vegas, Nevada. The concept was developed by the Las Vegas Convention and Visitors Authority, their advertising agency R&R Partners and Las Vegas resort partners who originally considered a number of magazine partners such as Bon Appetit, Food & Wine and Gourmet. Bon Appetit was selected as the magazine partner after a review with each magazine. The event was launched in 2007 by the Las Vegas Convention and Visitors Authority, "Bon Appétit" magazine led by Editor-in-Chief Barbara Fairchild and co-creator and Executive Director Rob O\'Keefe who led the first five years of development of what Eater.com called "the world\'s most innovative culinary event". Las Vegas resort partners over the years include Bellagio, Caesars Palace and Wynn Las Vegas, MGM Grand, Mandalay Bay, The Venetian, Las Vegas and The Palazzo and each year the event features more than 80 celebrated chefs and over 25 events occurring over a spectacular four-day weekend.', 'title': "Las Vegas Uncork'd"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'E. Brent Bryson (born June 19, 1957, in Wise, Virginia) is a nationally recognized criminal defense attorney based out of Las Vegas Nevada for the last 20 years. He was involved in the O.J. Simpson Las Vegas robbery case, in which he defended Simpson\'s co-defendant, Clarence "C.J." Stewart, who was ultimately convicted along with Simpson.', 'title': 'E. Brent Bryson'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Richard Ziser is a Nevada Real Estate Investor, Socially Conservative Political activist and U.S. Republican Politician. He was born June 7, 1953, in Pomona, CA., and has resided in Las Vegas Nevada since 1991. He graduated from California State Polytechnic University, Pomona (Cal Poly Pomona) with a BS in Industrial Engineering, 1976; then subsequently from Simon Greenleaf University in Santa Ana, Ca. (now a campus of Trinity International University, with an MA in Christian Apologetics in 1989.', 'title': 'Richard Ziser'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Las Vegas metropolitan area is home to many sports, most of which take place in the unincorporated communities around Las Vegas rather than in the city itself. The Las Vegas Valley has one major league professional team: the Vegas Golden Knights of the National Hockey League (NHL) who began play in 2017 as the region\'s first major pro team. The Oakland Raiders of the National Football League (NFL) will begin play in Las Vegas as the "Las Vegas Raiders" by 2020 and become the region\'s second major professional team. Las Vegas is also home to one minor league sports team: the Las Vegas 51s of the Triple-A Pacific Coast League (Minor League Baseball). The 51s are currently the only team to actually play in the city of Las Vegas, playing at the city owned Cashman Field. They will be joined in 2018 by the Las Vegas Lights FC of the United Soccer League, one of two leagues that collectively make up the second level of the U.S. men\'s soccer league system.', 'title': 'Sports in the Las Vegas metropolitan area'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The Las Vegas–Paradise, NV MSA, also known as the Las Vegas–Henderson–Paradise, NV Metropolitan Statistical Area (2013), is in the southern part of the U.S. state of Nevada, coextensive since 2003 with Clark County, Nevada. A central part of the metropolitan area is the Las Vegas Valley, a 600 sqmi basin that includes the metropolitan area's largest city, Las Vegas as well as the other primary city, Paradise, Nevada. The area contains the largest concentration of people in the state. Cities in the metropolitan area include Las Vegas, Henderson, North Las Vegas, and Boulder City. The metropolitan area is one of the top tourist destinations in the world, drawing over 40 million international and domestic visitors in 2013 with a GMP of US$103.3 billion.", 'title': 'Las Vegas–Paradise, NV MSA'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Charles William Forman (1821–1894) was a Presbyterian minister, missionary and the founder of Forman Christian College, a private university in Lahore, Pakistan.', 'title': 'Charles William Forman'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Scott Christian College is a college in Nagercoil, Tamil Nadu. It was established in 1809. It is one "A" College under NAAC ranking and is rated 5-star. It is also one of the nine colleges in Tamil nadu which were recognised by the central government as \'Institutes of Potential Research and Excellence\' along with Madras University and Madurai Kamaraj University. Scott Christian College is one of the earliest colleges in India along with Fort William College, Calcutta, started in 1800 which was closed in 1835, the Hindu College established in 1817 which was later named as Presidency University, Kolkata; the Serampore College in Serampore (Bengal) established in 1818 and the Bishop’s College, Calcutta(1820). It is the oldest college in the Erstwhile state of Travancore and Madras Presidency. Wikipedia says: "The Maharaja had occasion to visit a school that was imparting instruction in English at Nagarcoil under the auspices of the London Missionary Society (LMS). He was impressed by the school and the quality of the education given there and was convinced that the new type of school held out great prospects for the people of the state. The school later evolved into Scott Christian College, Nagercoil. Shortly thereafter he invited Mr. Roberts who was in-charge of the school at Nagarcoil to come to Thiruvananthapuram and start a similar school there. The educationist, who was an Englishman, agreed and a new school was started in 1834." The school started by Mr. Roberts has now blossomed into the University College, Thiruvananthapuram. So Scott Christian College is also linked to University college, and both are now reputed colleges. The alumni of the college are called Scottians.', 'title': 'Scott Christian College'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Purbanchal University (PU) is a public university in Biratnagar, the economic centre of Nepal. It was established in 1993 by the government of Nepal. It is on over 545 hectares.', 'title': 'Purbanchal University'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Kshitiz Educational Foundation is an institution of higher education at Tetari Gaachhi, Rajbiraj, Nepal. The college is established in 2010. The college belongs to the first group of colleges in Rajbiraj to receive academic accreditation from the Purbanchal University. At the beginning, the college offers only student of Bachelor in Business Administration (BBA) stream under Purbanchal University. Later the college authority offer 10+2 level courses.', 'title': 'Kshitiz Educational Foundation'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The WES Feminist Comic Con is an annual event held by the Women Empowerment Society from Forman Christian College in Lahore, Pakistan. The two day event focuses on bringing together fans from around the country, with a focus on celebrating women, either as the characters or as the creators in comic books, films, and other forms of media. The WES Feminist Comic Con first took place on November 2nd, 2016, at Forman Christian College, and is scheduled to take place again on the 17th and 18th of November, 2017.', 'title': 'WES Feminist Comic Con'}
