 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Jahangir Khan Tareen (Urdu: \u200e ; born 4 July 1953) is a Pakistani politician and businessman who is currently a member of the National Assembly of Pakistan and serving as the Secretary General of Pakistan Tehreek-e-Insaf (PTI). Born in Comilla, Tareen was educated at the Forman Christian College, Lahore, and later attended the University of North Carolina. Prior to entering politics, he had been a lecturer, and a banker.', 'title': 'Jehangir Khan Tareen'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Salman Humayun (Urdu: \u200e ) is a public policy expert with experience in managing, designing and delivering technical assistance and reform programs especially focusing on governance and education sectors in Pakistan. He is currently the executive director at Institute of Social and Policy Sciences and the co-editor of Journal of Social and Policy Sciences. He is also member board of advisors at Centre for Public Policy and Governance, Forman Christian College, Pakistan.', 'title': 'Salman Humayun'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Caliber International College is an institution of higher education at Rajbiraj, Nepal. The college is established in 2006. The founder of the college is Arun Yadav. The college belongs to the first group of colleges in Rajbiraj to receive academic accreditation from the Purbanchal University. The college offer 10+2 and Bachelor level courses. This is the first college in Rajbiraj which offer Bachelor in Business Administration (BBA) stream under Purbanchal University.', 'title': 'Caliber International College'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Hervey De Witt Griswold was born on May 24, 1860 in Dryden, New York to Benjamin and Laura Eliza (Hurd) Griswold. He attended Union College in Schenectady, New York from 1881 to 1885, and then went to Union Theological Seminary in New York City from 1885 to 1888. During the following two years Griswold had a fellowship at Oxford and Berlin Universities. Griswold began his 36-year-long career as a missionary in 1890 in Jhansi, India as a representative of the Board of Foreign Missions of the Presbyterian Church. In 1894 Griswold became Professor of Philosophy at Forman Christian College in Lahore, India (now Pakistan), teaching English and history there as well. As its librarian Griswold built the Foreman Christian College Library, adding a substantial number of books on religion and philosophy to the collection. Griswold also served as secretary of the India Council of the Presbyterian Missions. In 1900 Griswold received his Ph.D. from Cornell University, based on his thesis on the Indian Philosophy known as Brahman. In 1910 Griswold obtained his Doctor of Divinity. A prolific writer, he wrote about Hinduism and other Indian religions. He also wrote about the Founder of the Ahmadiyya Movement, Mirza Ghulam Ahmad, at a time when Ahmad was alive, and critically analyzed his claims to be the promised Messiah and Mahdi.', 'title': 'Hervey De Witt Griswold'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The 2017–18 Southampton F.C. season is the club's 19th season in the Premier League and 41st in the top division of English football. In addition to the Premier League, the club will also compete in the FA Cup and competed in the EFL Cup. The season is the club's first with manager Mauricio Pellegrino, who replaced the departed Claude Puel after one season in charge on 23 June 2017. As of 30 September 2017, Southampton are twelfth in the Premier League table having won two, drawn two and lost three of their first seven matches of the season. They were knocked out of the EFL Cup in the second round by Wolverhampton Wanderers.", 'title': '2017–18 Southampton F.C. season'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Mauricio Roberto Pochettino (] , ] ; born 2 March 1972) is an Argentine former footballer who played as a central defender, and is the current manager of Premier League club Tottenham Hotspur.', 'title': 'Mauricio Pochettino'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The 1946–47 Southampton F.C. season was the club's 18th season in the Football League Second Division and their 20th in the Football League. Southampton finished the season in 14th place in the league table, having won 15, drawn 9 and lost 18 of their 42 matches. The club also made it to the fourth round of the FA Cup. Inside forward Jack Bradley finished the season as the club's top scorer in the league with 14 goals, while centre forward George Lewis finished as joint top scorer in all competitions alongside Bradley, with 15 goals.", 'title': '1946–47 Southampton F.C. season'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Ronald Koeman (] ; born 21 March 1963) is a former Dutch footballer and the current manager of English club Everton. He is the younger brother of former Feyenoord coach Erwin Koeman and the son of former Dutch international Martin Koeman. A composed player on the ball, Koeman was capable of being deployed both as a defender and as a midfielder, and he frequently played as a sweeper, due to his vision and his ability on the ball. Regarded as one of the best and most prolific attacking central defenders of all time, Koeman was renowned for his long-range passing, as well as his shooting accuracy and power from distance, especially on free kicks, and is the top scoring defender in world football; he was also an accurate penalty kick taker.', 'title': 'Ronald Koeman'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "The 2010–11 Southampton F.C. season was the club's 71st and sixth consecutive season in The Football League, and their second in League One. Having narrowly missed out on the chance of promotion the previous season, Southampton were again seeking to reclaim their place in The Championship by being promoted in 2011. Before the commencement of the campaign, Southampton were slated as the favourites to win the League One title by a number of bookmakers, commentators and fans.", 'title': '2010–11 Southampton F.C. season'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "The 2014–15 Southampton F.C. season was the club's 16th season in the Premier League and their 38th in the top division of English football. It was also the club's first season with Dutch manager Ronald Koeman, who replaced Mauricio Pochettino on 16 June 2014. Southampton finished seventh in the Premier League, having won 18, drawn six and lost 14 matches. The club also made it to the fourth round of the FA Cup and the fifth round of the League Cup.", 'title': '2014–15 Southampton F.C. season'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The 2013–14 season was Feyenoord's 106th season of play, it marked its 58th season in the Eredivisie and its 92nd consecutive season in the top flight of Dutch football. They ended their league campaign as runners-up. They entered the KNVB Cup in the second round and reached the quarter-final. Their Europa League appearance consisted of the play-off round. It was the third straight season with manager Ronald Koeman, who did not renew his contract at the conclusion of the season.", 'title': '2013–14 Feyenoord season'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The 2016–17 Southampton F.C. season was the club's 18th season in the Premier League and their 40th in the top division of English football. In addition to the 2016–17 Premier League, the club also competed in the FA Cup, EFL Cup and UEFA Europa League. The season was the club's only campaign with manager Claude Puel, who took over from Ronald Koeman on 30 June 2016. The club finished eighth in the Premier League table, having won twelve, drawn ten and lost sixteen of their 38 matches played. They were knocked out of the UEFA Europa League at the group stage, having won two, drawn two and lost two of their matches, and the FA Cup in the fourth round, while they finished as runners-up in the EFL Cup Final losing 3–2 to Manchester United.", 'title': '2016–17 Southampton F.C. season'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 2013–14 Southampton F.C. season was the club's 15th season in the Premier League, and their 37th in the top division of English football. Having secured their place in the Premier League the previous season following a seven-year absence from the top flight, the club progressed in their league performance and achieved their main aim of a top-ten finish. Southampton finished eighth in the Premier League table, having won 15, drawn 11, and lost 12 of their 38 games played: their best season since 2002–03. They also made it to the fifth round of the FA Cup and the fourth round of the League Cup.", 'title': '2013–14 Southampton F.C. season'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The 2012–13 season was Feyenoord's 105th season of play, it was their 57th season in the Eredivisie and its 91st consecutive season in the highest Dutch football division. The club ended its league campaign in third place, being undefeated at home, and reached the quarter-finals of the KNVB Cup. Their European campaign ended after four matches, two each in the UEFA Champions League and UEFA Europa League. It was the club's second season under manager Ronald Koeman.", 'title': '2012–13 Feyenoord season'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Paul Éluard (] ), born Eugène Émile Paul Grindel (] ; 14 December 1895 – 18 November 1952), was a French poet and one of the founders of the surrealist movement.', 'title': 'Paul Éluard'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Georges Bataille\'s Story of the Eye is a 2004 experimental film adaptation of the 1928 novel "Story of the Eye" by the French writer Georges Bataille. The film, directed by Andrew Repasky McElhinney, takes place in a seemingly abandoned house where a group of people engage in wordless acts of passion. The film covers a period from evening to morning, and the sexual couplings among the members of the house becomes increasingly harrowing as daylight arrives.', 'title': "Georges Bataille's Story of the Eye"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Poclain is a family company founded by Georges Bataille in France in 1927, then developed by his sons Pierre and Claude Bataille, with help from Jacques and Bernard Bataille.', 'title': 'Poclain'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Accursed Share: An Essay on General Economy (French: "La Part maudite" ) is a book about political economy by the French intellectual Georges Bataille. Written between 1946 and 1949 and collected in volume seven of Bataille\'s complete works, it comprises three volumes: "Consumption", "The History of Eroticism", and "Sovereignty." First published by Les Éditions de Minuit in 1949, the book was re-edited in 1967, and was published in English translation in 1988 by Zone Books, in a two-volume edition. "The Accursed Share" is considered one of the most important of Bataille\'s books. However, it received mixed reviews on the publication of its English translation.', 'title': 'The Accursed Share'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Laurence Bataille (1930–1986) was a French psychoanalyst and writer. She was the only daughter of the writer Georges Bataille and the actress Sylvia Bataille.', 'title': 'Laurence Bataille'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Derived from the Greek ἀκέφαλος ("akephalos", literally "headless"), Acéphale is the name of a public review created by Georges Bataille (which numbered five issues, from 1936 to 1939) and a secret society formed by Bataille and others who had sworn to keep silent.', 'title': 'Acéphale'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Georges Albert Maurice Victor Bataille (] ; 10 September 1897 – 9 July 1962) was a French intellectual and literary figure working in literature, philosophy, anthropology, economics, sociology and history of art. His writing, which included essays, novels, and poetry, explored such subjects as eroticism, mysticism, surrealism, and transgression. His work would prove influential on subsequent schools of philosophy and social theory, including poststructuralism.', 'title': 'Georges Bataille'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Friedrich Nietzsche\'s influence and reception varied widely and may be roughly divided into various chronological periods. Reactions were anything but uniform, and proponents of various ideologies attempted to appropriate his work quite early. By 1937, this led Georges Bataille to argue against any "instrumentalization" of Nietzsche\'s thought, paradoxically as a social-anarchist himself; Bataille, the passionate, determined socialist and anti-fascist, believed that any simple-minded interpretation or unified ideological characterization of Nietzsche\'s work, granting predominance to any particular aspect, failed to do justice to the body of his work as a whole.', 'title': 'Influence and reception of Friedrich Nietzsche'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Sylvia Bataille (1 November 1908 – 23 December 1993) was a French actress, born Sylvia Maklès in Paris (where she also died), of Romanian-Jewish descent. When she was twenty, she married the writer Georges Bataille with whom she had a daughter, the psychoanalyst Laurence Bataille (1930–1986). Georges Bataille and Sylvia separated in 1934 but did not divorce until 1946. Starting in 1938, she was a companion of the psychoanalyst Jacques Lacan with whom, in 1941, she had a daughter, Judith, today Judith Miller. Sylvia Bataille married Jacques Lacan in 1953.', 'title': 'Sylvia Bataille'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Exposition Internationale du Surréalisme was an exhibition by surrealist artists that took place from January 17 to February 24, 1938, in the generously equipped Galérie Beaux-Arts, run by Georges Wildenstein, at 140, Rue du Faubourg Saint-Honoré in Paris. It was organised by the French writer André Breton, the surrealists\' brain and theorist, and Paul Éluard, the best known poet of the movement. The catalogue listed, along with the above, Marcel Duchamp as generator and arbitrator (to appease the partly fierce conflicts mainly between Breton and Éluard), Salvador Dalí and Max Ernst as technical advisers, Man Ray as head lighting technician and Wolfgang Paalen as responsible for the design the entrance and main hall with "water and foliage". The exhibition was staged in three sections, showing paintings and objects as well as unusually decorated rooms and mannequins which had been redesigned in various ways. With this holistic presentation of surrealist art work the movement wrote exhibition history.', 'title': 'Exposition Internationale du Surréalisme'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'General Nicholas Joseph "Nick" Fury is a fictional character appearing in comic books published by Marvel Comics\' Ultimate Marvel section as a different version of Nick Fury or Nick Fury Jr., his son and successor as director of S.H.I.E.L.D. He has a substantial presence in all the Ultimate Marvel comics, appearing first in "Ultimate Marvel Team-Up" and "Ultimate X-Men" and later reappearing regularly in "Ultimate Spider-Man" and finally securing a regular, recurring role as the general of S.H.I.E.L.D. and the leader of the Ultimates, a re-imagining of the Avengers. This character was designed to look like Samuel L. Jackson, the actor who later went on to portray Nick Fury in several Marvel movies and television shows set in the established Marvel Cinematic Universe.', 'title': 'Ultimate Nick Fury'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Andrea von Strucker and Andreas von Strucker are two fictional characters appearing in American comic books published by Marvel Comics. They are the German twin children of supervillain Baron von Strucker of HYDRA and the half-siblings of Werner von Strucker.', 'title': 'Fenris (comics)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Nick Fury vs. S.H.I.E.L.D. is a six issue comic book miniseries published by Marvel Comics in 1988. It was written by Bob Harras and drawn by Paul Neary. Each issue is 48 pages long and are referred to as books. The series was the first time in almost twenty years when Nick Fury and S.H.I.E.L.D. was the main focus and the series sold exceptionally well. Prompting Marvel to produce an ongoing series of "Nick Fury, Agent of S.H.I.E.L.D." in 1989 that lasted 47 issues.', 'title': 'Nick Fury vs. S.H.I.E.L.D.'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'These are tiles about the characters of Nick Fury, Nick Fury Jr., Ultimate Nick Fury or any other alternative version of the character published by Marvel Comics.', 'title': 'List of Nick Fury comics'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Bunduki is a 1975 novel by J. T. Edson, and the first work in the "Bunduki" series that followed. The series involves characters related to Tarzan and was initially authorized by the estate of Edgar Rice Burroughs. In the opening of the novel the main protagonists are transported from Earth to Zillikian (see below).', 'title': 'Bunduki'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Nick Fury: Agent of S.H.I.E.L.D. is an American television film based on the Marvel Comics character Nick Fury. It was first broadcast on May 26, 1998 on Fox. Directed by Rod Hardy, the film stars David Hasselhoff as Fury, a retired super spy who is approached to return to duty to take down the terrorist organization HYDRA, who threaten to attack Manhattan with a pathogen they have reconstituted known as the Death\'s Head virus. Lisa Rinna plays Contessa Valentina "Val" Allegra de Fontaine, and Sandra Hess plays Andrea von Strucker / Viper. It was released on DVD on September 30, 2008.', 'title': 'Nick Fury: Agent of S.H.I.E.L.D. (film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Nick Fury is a 2017 ongoing comic book series published by Marvel Comics. The series is written by James Dale Robinson and primarily drawn by ACO. It is the first series to feature Nick Fury Jr. as its main character.', 'title': 'Nick Fury (2017 comic book)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Nick Fury, Agent of S.H.I.E.L.D. was a feature on in the anthology comic "Strange Tales" it introduced the fictional spy agency S.H.I.E.L.D. into the Marvel Comics world and reintroduced the character of Nick Fury as an older character from his currently running series "Sgt. Fury", which was a WWII comic. The feature replaced the previously running Human Torch feature in the book and ran alongside the Dr. Strange feature. After the feature ended a comic title was published which has had several volumes as well as a comic strip.', 'title': 'Nick Fury, Agent of S.H.I.E.L.D. (feature)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Nick Fury, Agent of S.H.I.E.L.D.: Empyre is a fortyeight page novel written by Will Murray and published by Berkley Books and Marvel Comics in 2000. It is the first appearance of the character of Nick Fury in novel form. It features illustrations by longtime Nick Fury artist Jim Steranko. The plot revived the concept of S.H.I.E.L.D.'s psychic sensory division from the old Stan Lee and Jack Kirby comics.", 'title': 'Nick Fury, Agent of S.H.I.E.L.D.: Empyre'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Wolverine/Nick Fury: The Scorpio Connection is a 1989 graphic novel published by Marvel Comics and written by Archie Goodwin and drawn by Howard Chaykin. The story concerns a new Scorpio who is attempting to kill Nick Fury while Wolverine becomes involved when he investigates the murder of a friend who once saved his life at the hands of the new Scorpio. It is the first part of the Wolverine/Nick Fury trilogy.', 'title': 'Wolverine/Nick Fury: The Scorpio Connection'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Hinterrhein (German; Romansh: "Rein Posteriur" ; English: Posterior Rhine ) is one of the two initial tributaries of the Rhine (less in length but bigger by volume) in the canton of Graubünden in Switzerland, flowing from the village Hinterrhein near the San Bernardino Pass through the Rheinwald valley into a gorge called Roflaschlucht. In this gorge an equally sized tributary, the Avers Rhine, adds waters from the deep Val Ferrera and the very remote alp Avers and its side valley "Valle di Lei" on Italian territory. After the Rofla Gorge, the valley widens into a section called Schams. The Hinterrhein then reaches Andeer, before passing through another gorge, Viamala just before Thusis. Now another tributary of slightly bigger volume reaches the Hinterrhein as the Landwasser, draining a system of valleys, which is commonly known as Davos joins via the Albula coming from the Albula Pass, which is also the name of a railway line that has become a UNESCO world heritage. Another big tributary of Albula river is Gelgia from the Julier pass area. After flowing to Rothenbrunnen through a valley called Domleschg with an incredible number of castles (showing the importance of transit in the area) again the river is left alone from civilisation in the floodplain "Isla Bella" near Rhäzüns, before it joins the Anterior Rhine at Reichenau, all of them also in Graubünden.', 'title': 'Hinterrhein (river)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Chiari-like malformation (CM) is the most common cause of foramen magnum obstruction and syringomyelia in dogs. Syringomyelia (SM) is a disease of the spinal cord typified by fluid filled cavities, or syrinxes, within the spinal cord substance. The disease is caused by the obstruction of cerebrospinal fluid (CSF), in the nervous system. A situation of high pressure in the spinal cord compared to low pressure outside, leads to fluid accumulation, which eventually forms cavities. CM is a condition characterized by the mismatch of size between the brain and the skull. The skull is too small causing part of the brain to descend out of the skull through the opening at its base, crowding the spinal cord. The cause of CM is not yet fully understood. CM is rare in most breeds but reportedly has become very widespread in the Cavalier King Charles Spaniel and the Griffon Bruxellois (Brussels Griffon). Some researchers estimate that as many as 95% of CKCSs may have CM. It is worldwide in scope and not limited to any country, breeding line, or kennel, and experts report that it is believed to be inherited in the Cavalier King Charles Spaniel. CM is so widespread in the Cavalier that it may be an inherent part of the CKCS's breed standard. This disease not only affects thousands of dogs, but a similar condition affects over three hundred thousand children yearly. Therefore, canines are an appropriate model for the treatment of the human condition.", 'title': 'Canine Chiari-like malformation'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Griffon Bruxellois or Brussels Griffon is a breed of toy dog, named for their city of origin: Brussels, Belgium. The Griffon Bruxellois may refer to three different breeds, the Griffon Bruxellois, the Griffon Belge and the Petit Brabançon. Identical in standard except for coat and colour differences, in some standards they are considered varieties of the same breed, much like Belgian Shepherd Dogs.', 'title': 'Griffon Bruxellois'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Molossus of Epirus (Greek: Μολοσσός της Ηπείρου) is a large dog breed originating from Greece. It is a livestock guardian that has been bred since the age of Alexander the Great for protecting livestock from carnivorous mammals including the wolf, European jackal and the brown bear in the mountainous regions of Greece, especially Epirus. The Molossus is a pure Greek breed and is believed to be one of the main ancestors of today's Molosser breeds, such as the English Mastiff and the Neapolitan Mastiff,", 'title': 'Molossus of Epirus'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Aicama Zorba of La-Susa or Zorba (26 September 1981 - Unknown ) was a male Old English Mastiff who was recognized by Guinness World Records as the heaviest and longest dog in the world.', 'title': 'Zorba (dog)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The Bullmastiff is a large-sized breed of domestic dog, with a solid build and a short muzzle. The Bullmastiff shares the characteristics of molosser dogs, and was originally developed by 19th-century gamekeepers to guard estates. The breed's bloodlines are drawn from the English Mastiff and the extinct Old English Bulldog. It was recognized as a purebred dog by the English Kennel Club in 1924. They are quiet dogs and very rarely bark.", 'title': 'Bullmastiff'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Griffon Fauve de Bretagne (FCI No.66) translated into English as the Fawn Brittany Griffon, is a breed of dog of the scenthound type, originating in France in the region of Brittany.', 'title': 'Griffon Fauve de Bretagne'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Dog anatomy comprises the anatomical studies of the visible parts of the body of a canine. Details of structures vary tremendously from breed to breed, more than in any other animal species, wild or domesticated, as dogs are highly variable in height and weight. The smallest known adult dog was a Yorkshire Terrier that stood only 6.3 cm at the shoulder, 9.5 cm in length along the head and body, and weighed only 113 g . The largest known adult dog was an English Mastiff which weighed 155.6 kg and was 250 cm from the snout to the tail. The tallest known adult dog is a Great Dane that stands 106.7 cm at the shoulder.', 'title': 'Dog anatomy'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Trevor Dwyer-Lynch 1968, is a Black British actor, presenter, and stand up comedian. Born and raised in Moss Side and Salford, calls himself a "Mossfordian" trained in Drama and Performing Arts at City College /Arden School of Theatre Manchester in 1990, Dwyer-Lynch has appeared in numerous television and theatre productions, merging both serious roles—such as "Gloucester" in Shakespeare\'s King Lear— to his best known comedic role in "Coronation Street" as Patrick Tussell the taxi-driver working for Steve McDonald (2002–2005). A dog lover, his 15-stone, Old English Mastiff also appeared with him in an episode, his dog spoiling "Patrick\'s" attempt to win over love interest Janice Battersby. Lynch achieved one of his wishes working for the Ken Loach in "Looking for Eric", he publicly expresses a desire to work with Directors Shane Meadows, Mike Leigh and Steve McQueen', 'title': 'Trevor Dwyer-Lynch'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The English Mastiff is a breed of extremely large dog (often known simply as the Mastiff) perhaps descended from the ancient Alaunt and Pugnaces Britanniae, with a significant input from the Alpine Mastiff in the 19th century. Distinguishable by enormous size, massive head, and a limited range of colours, but always displaying a black mask, the Mastiff is noted for its gentle and loving nature. The lineage of modern dogs can be traced back to the early 19th century, but the modern type was stabilised in the 1880s and refined since. Following a period of sharp decline, the Mastiff has increased its worldwide popularity. Throughout its history, the Mastiff has contributed to the development of a number of dog breeds, some generally known as Mastiff-type dogs, or, confusingly, just as "Mastiffs".', 'title': 'English Mastiff'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'United States v. Kirby Lumber Co., 284 U.S. 1 (1931), was a case in which the United States Supreme Court held that when a corporation settles its debts for less than the face amount, a taxable gain has occurred.', 'title': 'United States v. Kirby Lumber Co.'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Monroe v. Pape, 365 U.S. 167 (1961) , was a United States Supreme Court case that considered the application of federal civil rights law to constitutional violations by city employees. The case was significant because it held that 42 U.S.C. § 1983, a statutory provision from 1871, could be used to sue state officers who violated a plaintiff's constitutional rights. § 1983 had previously been a relatively obscure and little-used statute, but since Monroe it has become a central part of United States civil rights law.", 'title': 'Monroe v. Pape'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "The Slaughter-House Cases, 83 U.S. 36 (1873) , was the first United States Supreme Court interpretation of the U.S. Constitution's Fourteenth Amendment which had recently been enacted. It was a pivotal case in early civil rights law and held that the Fourteenth Amendment protects the privileges or immunities of citizenship of the United States, not privileges and immunities of citizenship of a state. However, federal rights of citizenship were then few, such as the right to travel between states and to use navigable rivers; the amendment did not protect the far broader range of rights covered by state citizenship. In effect, the amendment was interpreted to convey limited protection pertinent to a small minority of rights.", 'title': 'Slaughter-House Cases'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Freedom of movement under United States law is governed primarily by the Privileges and Immunities Clause of the United States Constitution which states, "The Citizens of each State shall be entitled to all Privileges and Immunities of Citizens in the several States." As far back as the circuit court ruling in "Corfield v. Coryell," 6 Fed. Cas. 546 (1823), freedom of movement has been judicially recognized as a fundamental Constitutional right. In "Paul v. Virginia," 75 U.S. 168 (1869), the Court defined freedom of movement as "right of free ingress into other States, and egress from them." However, the Supreme Court did not invest the federal government with the authority to protect freedom of movement. Under the "privileges and immunities" clause, this authority was given to the states, a position the Court held consistently through the years in cases such as "Ward v. Maryland," 79 U.S. 418 (1871), the "Slaughter-House Cases," 83 U.S. 36 (1873) and "United States v. Harris," 106 U.S. 629 (1883).', 'title': 'Freedom of movement under United States law'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Margo Jane Schlanger (born 1967) is a Professor of Law at the University of Michigan Law School, and the founder and director of the Civil Rights Litigation Clearinghouse. From 2010-2012, while on leave from her professorial position, she served as the presidentially-appointed Officer for Civil Rights and Civil Liberties at the United States Department of Homeland Security. As the top civil rights official at the Department of Homeland Security, Schlanger led the office that advises Department leadership about civil rights and civil liberties issues, engages with communities whose civil rights and civil liberties may be affected by Department activities, investigates and resolves civil rights complaints, and leads the Departments equal employment opportunity program. Schlanger's major initiatives as Civil Rights and Civil Liberties Officer included: creating and managing a structure for overseeing the Department's controversial Secure Communities program to ensure that it did not serve as a conduit for unconstitutional practices by local law enforcement agencies in jurisdictions covered by the program; publishing guidance for agencies that receive DHS funding on providing meaningful access to people with limited English proficiency; working with U.S. Immigration and Customs Enforcement on the reform of detention practices; and improving the Department's civil rights complaint process.", 'title': 'Margo Schlanger'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'During the tenure of Morrison Waite as Chief Justice of the Supreme Court of the United States (March 4, 1874 through March 23, 1888), the Supreme Court heard an unprecedented volume and frequency of criminal cases. In just fourteen years, the Court heard 106 criminal cases, almost as many cases as the Supreme Court had heard in the period from its creation to the appointment of Waite as Chief Justice. Notable cases include "United States v. Cruikshank" (1875), "United States v. Reese" (1875), "Reynolds v. United States" (1878), "Wilkerson v. Utah" (1879), the "Trade-Mark Cases" (1879), "Strauder v. West Virginia" (1880), "Pace v. Alabama" (1883), "United States v. Harris" (1883), "Ex parte Crow Dog" (1883), "Hurtado v. California" (1884), "Clawson v. United States" (1885), "Yick Wo v. Hopkins" (1886), "United States v. Kagama" (1886), "Ker v. Illinois" (1886), and "Mugler v. Kansas" (1887).', 'title': 'Criminal law in the Waite Court'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Marshall Court (1801–1835) heard forty-one criminal law cases, slightly more than one per year. Among such cases are "United States v. Simms" (1803), "United States v. More" (1805), "Ex parte Bollman" (1807), "United States v. Hudson" (1812), "Cohens v. Virginia" (1821), "United States v. Perez" (1824), "Worcester v. Georgia" (1832), and "United States v. Wilson" (1833).', 'title': 'Criminal law in the Marshall Court'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'United States v. Darby Lumber Co., 312 U.S. 100 (1941) , was a case in which the United States Supreme Court upheld the Fair Labor Standards Act of 1938, holding that the U.S. Congress had the power under the Commerce Clause to regulate employment conditions. The unanimous decision of the Court in this case overturned "Hammer v. Dagenhart" 247 U.S. 251 (1918) , limited the application of "Carter v. Carter Coal Company" 298 U.S. 238 (1936) , and confirmed the underlying legality of minimum wages held in "West Coast Hotel Co. v. Parrish" 300 U.S. 379 (1937) .', 'title': 'United States v. Darby Lumber Co.'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Sexual Orientation Non-Discrimination Act (SONDA) is a New York law which prohibits discrimination on the basis of actual or perceived sexual orientation in employment, housing, public accommodations, education, credit, and the exercise of civil rights. SONDA added the term “sexual orientation” to the list of specifically protected characteristics in various State laws, including the Human Rights Law, the Civil Rights Law, and the Education Law.', 'title': 'Sexual Orientation Non-Discrimination Act'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The proposed Convention on the Rights of Older Persons is regarded as the next major United Nations human rights treaty. The proposed treaty will seek to remedy the fragmented human rights structure for older persons, and will focus on reaffirming critical human rights which are of concern to the elderly. The focus of the treaty will be persons over 60 years of age, which is a growing demographic worldwide due to increased population ageing. The treaty follows from the success of the United Nations Convention on the Rights of the Child which has seen near universal acceptance since 1989. Where the UNCRC focuses on the rights of younger persons, the UNCROP will address those who form the older portion of society, who according to United Nations reports, are becoming increasingly vulnerable as a group without applicable normative standards of Human Rights Law. Support for a Convention is becoming increasingly popular, as human rights groups including the Committee on Economic, Social and Cultural Rights (CESCR), HelpAge International, the Committee on the Elimination of Discrimination against Women, the International Labour Organization, and many other NGOs and states have expressed support for a universal instrument. The need for a treaty has arisen due to issues surrounding demographic changes from population ageing. This has led to significant interest in how to best ensure the well being of older persons. Among the rights issues faced by older persons are their rights against ageist discrimination, and the rights to participation. The debate surrounding the convention focuses on the implementation and safeguarding of these rights, to set normative standards of human rights for older persons. One substantive issue is the conception of elder abuse as between individuals. Individual relationships generally fall outside of current human rights law, which seeks to present standards of relations between states and individuals. Therefore, it has been suggested that the proposed human rights convention for older persons ought to be drafted as an anti-discrimination convention. However, This would not be consistent with other multilateral human rights conventions such as the ICCPR and ICESCR which set normative standards.', 'title': 'Convention on the Rights of Older Persons'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Collinsville City Hall and Fire Station are two connected buildings located at 125 Center St. in Collinsville, Illinois. The Italianate City Hall was built in 1885. It was Collinsville's first dedicated city hall; prior to its completion, government meetings were held at the mayor's house. The new city hall, along with several other public works projects, created a large debt which contributed to mayor Charles L. Oatman's defeat in the next election. The Romanesque Revival fire station was built next to City Hall in 1910. Additions in 1972 and 1994 connected the two buildings. A Civil War monument on the southeast corner the property was dedicated in 1926; while it was originally located between the two buildings, it moved to its current location when the fire station expanded in 1956.", 'title': 'Collinsville City Hall and Fire Station'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Northwestern Knitting Company Factory, also known as Munsingwear Corporation and later as International Market Square, is a former factory building in the Sumner-Glenwood neighborhood of Minneapolis, Minnesota, United States. The company was founded in 1888 by George D. Munsing, who invented a method of plating wool fibers with silk and cotton to make the union suit more comfortable. The company received financial backing from Clinton Morrison and Charles Alfred Pillsbury, who were prominent businessmen in the Minneapolis flour milling industry. This style of underwear, patented in 1891, proved to be very popular, and the company eventually became the world's largest manufacturer of underwear. The company changed its name in 1919 to Munsingwear.", 'title': 'Northwestern Knitting Company Factory building'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Firstar Center was the name previously used by two buildings before Firstar Corporation changed its name to U.S. Bancorp. The two buildings are now named:', 'title': 'Firstar Center'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Advance Thresher/Emerson-Newton Implement Company buildings in Minneapolis, Minnesota, United States, are a pair of buildings designed by Kees and Colburn. The two buildings are united under a common cornice and appear to be a single structure. However, the two buildings were actually built four years apart. The Advance Thresher Company building was built in 1900 and has six floors. The adjacent Emerson-Newton Plow Company building was built in 1904 and has seven floors.', 'title': 'Advance Thresher/Emerson-Newton Implement Company'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Beer, called maekju (맥주 ; 麥酒 ) in Korean, was first introduced to Korea in the early 20th century. Seoul's first beer brewery opened in 1908. Two current major breweries date back to the 1920s. The third brewery established in Korea, Jinro Coors Brewery, was founded in the 1990s. It was later acquired by Oriental Breweries (OB). Hite Breweries's former name was Chosun Breweries, which was established in 1933. The company changed their name to Hite Breweries in 1998. OB Breweries established as Showa Kirin Breweries in 1933. The company changed their name to OB Breweries in 1995.", 'title': 'Beer in South Korea'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Firstar Corporation was a Milwaukee, Wisconsin-based regional bank holding company that later became U.S. Bancorp, a nationwide bank corporation in the United States. In 2001, Firstar acquired U.S. Bancorp and assumed its name, moving its headquarters to Minneapolis.', 'title': 'Firstar Corporation'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Lynx Software Technologies, Inc. (formerly LynuxWorks) is a San Jose, California software company founded in 1988. Lynx Software Technologies specializes in secure virtualization and open and reliable real-time operating system (RTOS). Originally known as Lynx Real-Time Systems, the company changed its name to LynuxWorks in 2000 after acquiring, and merging with, ISDCorp (Integrated Software & Devices Corporation) a nine-year-old embedded systems company with a strong Linux background. In May 2014, the company changed its name to Lynx Software Technologies as a representation of the company’s forward direction as the LynxOS RTOS family of products and the LynxSecure hypervisor continued to gain increased traction both with current customers and markets, and with the new Internet connected embedded world.', 'title': 'Lynx Software Technologies'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'U.S. Bancorp is a bank holding company based in Minneapolis, Minnesota. It is the parent company of U.S. Bank, National Association, known as U.S. Bank, which is ranked 7th on the list of largest banks in the United States. The company provides banking, investment, mortgage, trust, and payment services products to individuals, businesses, governmental entities, and other financial institutions. It has 3,106 branches and 4,842 ATMs, primarily in the Midwestern United States. The company also owns Elavon, a processor of credit card transactions.', 'title': 'U.S. Bancorp'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Royal Worcester Corset Company, was founded as The Worcester Skirt Company by David Hale Fanning in 1861 in Worcester, MA, and first specialized in making hoop skirts. In 1872 the company changed its name to the Worcester Corset Co., to reflect its change of direction from hoop skirts to torso shaping. The company changed its name again in 1901, to the Royal Worcester Corset Company. In 1949 the company dropped the word 'corset' from its name and became known as the Royal Worcester Company, in response to falling interest in corsets.", 'title': 'Royal Worcester Corset Company'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Prince Motor Company was a Japanese automobile manufacturer from 1952 until its merger with Nissan in 1966. Prince began as the Tachikawa Aircraft Company, a manufacturer of various airplanes for the Japanese Army in World War II, e.g., the Ki-36, Ki-55 and Ki-74. Tachikawa Aircraft Company was dissolved after the war and the company took the name Fuji Precision Industries. It diversified into automobiles, producing an electric car, the Tama, in 1946, named for the region the company originated in, Tama, using the Ohta series PC/PD platform. The company changed its name to Prince in 1952 to honor Prince Akihito\'s formal investiture as Crown Prince. In 1954 they changed their name back to Fuji Precision Industries, and in 1961 changed the name back again to Prince Motor Company. In 1966, they became part of Nissan, while the Prince organization remained in existence inside Nissan, as "Nissan Prince Store" in Japan until Nissan consolidated the Prince dealership network into "Nissan Blue Stage" in 1999.', 'title': 'Prince Motor Company'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Johnny Antonio Taylor (born June 4, 1974) in Chattanooga, Tennessee, is the Player Development Coach for the VCU Men's Basketball team in Richmond, Virginia. Before his coaching career, Taylor played college basketball at the University of Tennessee - Chattanooga, earning So-Con Player of the Year Honors in 1997. Taylor went on to be the 17th overall pick in the 1997 NBA Draft, playing for the Orlando Magic, Denver Nuggets, Chicago Bulls, and Portland Trailblazers during his NBA tenure. In 2000, Taylor continued his professional career overseas, playing with teams in Italy, Philippines, Russia, South Korea, Spain, Lebanon, Belgium, Japan, Bahrain, and the United Arab Emirates until he retired in 2012.", 'title': 'Johnny Taylor (basketball)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 1996–97 NBA season was the 27th season for the Portland Trail Blazers in the National Basketball Association. During the offseason, the Blazers signed free agent Kenny Anderson while acquiring Isaiah Rider from the Minnesota Timberwolves, and second-year forward Rasheed Wallace from the Washington Bullets. The Blazers would hover around .500 for most of the first half of the season as they traded Aaron McKie to the Detroit Pistons for Stacey Augmon at midseason. However, they posted a 13–2 record in March including an 11-game winning streak. The Blazers finished the season third in the Pacific Division, and fifth in the Western Conference with a 49–33 record. Making their 15th straight trip to the postseason and 20th in 21 years.', 'title': '1996–97 Portland Trail Blazers season'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Jordan Russell Kent (born July 24, 1984 in Dhahran, Saudi Arabia) is a former American football wide receiver. He was drafted by the Seattle Seahawks in the sixth round of the 2007 NFL Draft. Jordan began playing football when he was a junior in college at the University of Oregon. While at the University of Oregon, Jordan also played Basketball and ran Track for the Oregon Ducks. Today Jordan is a broadcaster for Comcast Sportsnet, and he covers the Portland Trailblazers and Pac-12 football and basketball. He also runs popular youth sport camps throughout the state of Oregon.', 'title': 'Jordan Kent'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Stephen Anthony Smith (born October 14, 1967) is an American sports television personality, sports radio host, sports journalist, and actor. Smith is a commentator on "ESPN First Take", where he appears with Max Kellerman and Molly Qerim. He also makes frequent appearances as an NBA analyst on SportsCenter. He also is an NBA analyst for ESPN on "NBA Countdown" and NBA broadcasts on ESPN. Smith formerly hosted "The Stephen A. Smith and Ryan Ruocco Show" on ESPN Radio New York 98.7 FM He now hosts "The Stephen A. Smith Show" on the Chris Russo sports radio station: Mad Dog Sports Radio SiriusXM Radio, channel 82, and is a featured columnist for ESPNNY.com, ESPN.com, and The Philadelphia Inquirer.', 'title': 'Stephen A. Smith'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The 1998–99 NBA season was the 29th season for the Portland Trail Blazers in the National Basketball Association. During the offseason, the Blazers signed free agents Jim Jackson and Greg Anthony, who would reunite with his former UNLV teammate Stacey Augmon. Portland got off to a fast start winning 15 of their first 18 games, and went 35–15 in the lockout-shortened season, earning their fourth Pacific Division title and the first since 1991–92. Their record qualified them for the #2 seed in the Western Conference. The team earned their 17th straight trip to the playoffs, and 22nd in 23 years. Head coach Mike Dunleavy was named Coach of The Year.', 'title': '1998–99 Portland Trail Blazers season'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The 1996–97 NBA season was the Pistons' 49th season in the National Basketball Association, and 40th season in the city of Detroit. During the offseason, the Pistons re-signed free agent Rick Mahorn, who was a member of the championship team in the 1989 NBA Finals. The team also acquired Stacey Augmon and Grant Long from the Atlanta Hawks, but later on sent Augmon to the Portland Trail Blazers for Aaron McKie at midseason. The Pistons got off to a fast start winning ten of their first eleven games on their way to a 20–4 start. However, they went 34–24 for the remainder of the season finishing third in the Central Division with a 54–28 record. Grant Hill averaged 21.4 points, 9.0 rebounds, 7.3 assists and 1.8 steals per game, while finishing third in MVP voting behind Karl Malone and Michael Jordan. Hill along with Joe Dumars, and head coach Doug Collins represented the Eastern Conference during the 1997 NBA All-Star Game.", 'title': '1996–97 Detroit Pistons season'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Richard Mathias "Ric" Bucher (born 1961) is a SiriusXM radio host, afternoons (3-6pm PT/6-9pm ET) on the Mad Dog Sports Radio Channel and Fridays on SiriusXM NBA Radio (noon-2pm PT/3-5pm ET). He also signed a multi-year deal with BleacherReport.com in September 2014 to serve as a senior writer and NBA video analyst. He also appears occasionally on NBA TV as an NBA analyst and on TNT as a sideline reporter for NBA game telecasts. He also is the co-host of a weekly podcast with three-time NBA champion B.J. Armstrong called the "BJ and Bucher Show: 4 Quarters of Madness" which can be found on Audioboom and iTunes and the BJandBucher.com website. Bucher previously worked as an NBA Insider for Comcast SportsNet Bay Area and also co-hosted "Bucher, Towny and Huff" mornings on 95.7 The Game. Bucher was formerly an NBA analyst for ESPN and ESPN.com. He was also a senior writer for ESPN The Magazine and a columnist for ESPN.com.', 'title': 'Ric Bucher'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Gregory Carlton "Greg" Anthony (born November 15, 1967) is an American former National Basketball Association (NBA) player and is currently a television analyst for CBS Sports. Anthony also contributes to Yahoo! Sports as a college basketball analyst and serves as a co-host/analyst on SiriusXM NBA Radio.', 'title': 'Greg Anthony'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 1991–92 NBA season was the Hawks' 43rd season in the National Basketball Association, and 24th season in Atlanta. During the offseason, the Hawks acquired Maurice Cheeks from the New York Knicks. The Hawks had a complete change of guards turning over their backcourt to second-year guard Rumeal Robinson, and top draft pick Stacey Augmon out of UNLV. However, with a 22–20 record in late January, Dominique Wilkins ruptured his achilles tendon and was out for the remainder of the season. Without Wilkins, the Hawks would lose 24 of their final 40 games, including a 7-game losing streak. They finished fifth in the Central Division with a 38–44 record, missing the playoffs and losing a tie-breaker for the #8 seed in the Eastern Conference to the Miami Heat.", 'title': '1991–92 Atlanta Hawks season'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Jared Scott Carter Jeffries (born November 25, 1981) is a retired National Basketball Association player currently working as a pro personnel scout for the Denver Nuggets. Jeffries was drafted with the 11th overall pick of the 2002 NBA draft by the Washington Wizards. He also played for the New York Knicks, Houston Rockets, and Portland Trailblazers before retiring in 2013. In college, Jeffries played for the Indiana University Hoosiers; during his sophomore year, he was an integral part of the Hoosiers\' Cinderella run to the 2002 NCAA Championship game, was named Big Ten Player of the Year, and was a consensus second-team All-American. At 6\'11", he mainly played at the forward and center positions.', 'title': 'Jared Jeffries'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'In the trading card collecting hobby, an error card is a card that shows incorrect information or some other unintended flaw. It can contain a mistake, such as a misspelling or a photo of someone other than the athlete named on the card. Depending on whether the manufacturer noticed the problem while the cards were still being produced, a card may exist in both correct and incorrect versions. If the correction is made sufficiently early in the print run, the error card may be significantly rarer and more valuable than the corrected version. However, the opposite may be true if the error is corrected late in the printing cycle, resulting in a smaller population of the corrected version of the card compared to the error version.', 'title': 'Error card'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'In mathematics, particularly numerical analysis, the Bramble–Hilbert lemma, named after James H. Bramble and Stephen Hilbert, bounds the error of an approximation of a function formula_1 by a polynomial of order at most formula_2 in terms of derivatives of formula_1 of order formula_4. Both the error of the approximation and the derivatives of formula_1 are measured by formula_6 norms on a bounded domain in formula_7. This is similar to classical numerical analysis, where, for example, the error of linear interpolation formula_1 can be bounded using the second derivative of formula_1. However, the Bramble–Hilbert lemma applies in any number of dimensions, not just one dimension, and the approximation error and the derivatives of formula_1 are measured by more general norms involving averages, not just the maximum norm.', 'title': 'Bramble–Hilbert lemma'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Ernst Karl Abbe HonFRMS (23 January 1840 – 14 January 1905) was a German physicist, optical scientist, entrepreneur, and social reformer. Together with Otto Schott and Carl Zeiss, he laid the foundation of modern optics. Abbe developed numerous optical instruments. He was a co-owner of Carl Zeiss AG, a German manufacturer of research microscopes, astronomical telescopes, planetariums and other optical systems.', 'title': 'Ernst Abbe'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Othello error occurs when a suspicious observer discounts cues of truthfulness. Essentially the Othello error occurs, Paul Ekman states, "when the lie catcher fails to consider that a truthful person who is under stress may appear to be lying" their non-verbal signals expressing their worry at the possibility of being disbelieved. A lie-detector or polygraph may be deceived in the same way, by misinterpreting nervous signals from a truthful person. The error is named after William Shakespeare\'s tragic play "Othello"; the dynamics between the two main characters, Othello and Desdemona are a particularly notable example of the error in practice.', 'title': 'Othello error'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'A description error or selection error is an error, or more specifically a human error, that occurs when a person performs the correct action on the wrong object due to insufficient specification of an action which would have led to a desired result. This commonly happens when similar actions lead to different results. A typical example is a panel with rows of identical switches, where it is easy to carry out a correct action (flip a switch) on a wrong switch due to their insufficient differentiation.', 'title': 'Description error'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'A Porro–Abbe prism (sometimes called a Abbe–Porro prism), named for Ignazio Porro and Ernst Abbe, is a type of reflection prism used in some optical instruments to alter the orientation of an image. It is a variant of the more common double Porro prism configuration.', 'title': 'Porro–Abbe prism'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Ernst Abbe Sportfield is a sports facility in Jena, Germany. It was dedicated on August 24, 1924 and was named after entrepreneur Ernst Abbe 15 years later. The facility is in southern Jena, directly on the Saale River. The City of Jena purchased the stadium from the Ernst-Abbe-Stiftung (The Ernst Abbe Foundation) in 1991.', 'title': 'Ernst-Abbe-Sportfeld'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Abbe error, named after Ernst Abbe, also called sine error, describes the magnification of angular error over distance. For example, when one measures a point that is 1 meter away at 45 degrees, an angular error of 1 degree corresponds to a positional error of over 1.745\xa0cm, equivalent to a distance-measurement error of 1.745%.', 'title': 'Abbe error'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Van Abbemuseum (] ) is a museum of modern and contemporary art located in central Eindhoven, Netherlands, on the east bank of the Dommel river. Established in 1936, the Abbe Museum is named after its founder, Henri van Abbe. Van Abbe was a lover of modern art and wanted to enjoy it there from Eindhoven. As of 2010, the collection of the museum houses more than 2700 works of art, of which about 1000 are on paper, are 700 paintings, and 1000 are sculptures, installations and video work.', 'title': 'Van Abbemuseum'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Errors of impunity is a term used in Brian Forst\'s book "Errors of Justice" and in Robert Bohm\'s introduction to a special edition of "The Journal of Criminal Justice" on miscarriages of justice. They are defined as lapses that result in criminals either remaining at large or receiving sanctions that are below a socially optimal level. If convicting an innocent person, called a miscarriage of justice, is a Type I error for falsely identifying culpability (a "false positive"), then an error of impunity would be a Type II error of failing to find a culpable person guilty (a "false negative").', 'title': 'Errors of impunity'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Praises to the War Machine is the debut and only solo release/album by heavy metal vocalist Warrel Dane from Nevermore, released on April 25, 2008. The album was produced by Peter Wichers, who was tapped by Dane to work on the album while Wichers was still a member of Soilwork. After leaving that band in 2007, Wichers co-wrote the album with Dane and played on eight of its tracks. Soilwork drummer Dirk Verbeuren and former Himsa guitarist Matt Wicklund also played on the album. Nevermore guitarist Jeff Loomis and the band\'s touring guitarist at the time Chris Broderick make guest appearances, along with James Murphy, who had performed on the Nevermore album "This Godless Endeavor". "Praises to the War Machine" includes two cover songs, The Sisters of Mercy\'s "Lucretia My Reflection" and "Patterns" by Paul Simon. Dane had previously covered a Simon song on Nevermore\'s album "Dead Heart in a Dead World".', 'title': 'Praises to the War Machine'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Sanctuary is an American heavy metal band founded in Seattle in 1985. They split up in 1992, but reformed 18 years later. The band consists of Warrel Dane (vocals), Lenny Rutledge (guitar), Nick Cordle (guitar), George Hernandez (bass), and Dave Budbill (drums). To date, they have released four studio albums and one live EP.', 'title': 'Sanctuary (band)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Nevermore is an American progressive metal band from Seattle, Washington, United States. Formed in 1991, they are known to incorporate elements from various styles such as power metal, modern hard rock, classic heavy metal and technical thrash metal. The band has been on hiatus since 2011, due to personal issues between the band members. In April 2015, lead singer Warrel Dane confirmed that Nevermore has not disbanded, and there is a possibility for them to continue in the next two years with another album.', 'title': 'Nevermore'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Nevermore is the eponymous debut studio album by American heavy metal band Nevermore, released on February 14, 1995 by Century Media Records. It was singer Warrel Dane and bassist Jim Sheppard's first release after departing from their previous band, Sanctuary, in 1994. Having recruited drummer Van Williams and former Sanctuary touring guitarist Jeff Loomis, they formed the band Nevermore and began anew.", 'title': 'Nevermore (album)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Year Of The Voyager is a double DVD/CD released by Nevermore. It was released in Europe on October 20, 2008 and in North America on November 25, 2008 via Century Media. The set covers the "This Godless Endeavor" touring cycle, starting with live footage from the U.S. Gigantour 2005, the Metal Mania festival 2006 in Poland, the Wacken Open Air festival in 2006 in Germany and the main DVD show recorded at the Zeche in Bochum, Germany. Bonus material includes two songs from Century Media USA 10th Anniversary Party 2001, all promo videos and an interview with singer Warrel Dane which was recorded at the Roax Film Studios in Berlin in the spring of 2008.', 'title': 'The Year of the Voyager'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Toshimitsu Deyama (出山利三 , Deyama Toshimitsu , born October 10, 1965 in Tateyama, Chiba) , known exclusively by his stage name Toshi, is a Japanese singer and songwriter. He is best known as the lead vocalist and a co-founder of the heavy metal band X Japan, which disbanded in 1997. Toshi then went on to have an extensive solo career. In 2007, X Japan reunited and began an ongoing world tour in 2010. His distinctive, impassioned tenor vocals have been compared to those of Steve Perry.', 'title': 'Toshi (musician)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Warrel Dane (born March 7, 1969) is the lead singer of the American power metal band Sanctuary. He is also known as the former lead singer of currently inactive progressive metal band Nevermore. He is a natural baritone, though he was known for his high-pitched vocals with Serpent's Knight and on the first two Sanctuary albums. Later in his career, Dane became more notable for his distinctively deep, dramatic voice.", 'title': 'Warrel Dane'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Dreaming Neon Black is the third full-length album released by Seattle progressive metal band Nevermore, and was released through Century Media in 1999. Unlike its predecessor, "The Politics of Ecstasy", this album is very emotional and contains many slower, ballad-type songs. It is also notable that "Dreaming Neon Black" is a concept album of sorts. According to Nevermore\'s lead singer, Warrel Dane, "it\'s a very simple story about a man who slowly goes insane after losing a woman that he was very close to. Progressive levels of insanity are expressed in the songs, he goes through phases of denial and self-blame, blaming God, then denouncing God. The ending is a little...tragic, a little depressing. Shakesperian. Everybody dies, it\'s all happy." , which may be based on an event in the life of Dane. Supposedly, his old girlfriend left him when she joined a religious cult and was never heard from again, and he began having nightmares of her crying out to him as she drowned. This has been confirmed by Warrel himself in an older interview. The spoken word samples from the tracks "Ophidian" and "Forever" are from the Clive Barker movie, "Lord of Illusions".', 'title': 'Dreaming Neon Black'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Peter Wichers is best known as one of the founding members of Swedish melodic death metal band, Soilwork. From 1995 until late 2005, when he announced his departure from the band, he was known as the lead guitarist and also a songwriter, especially on their "Stabbing the Drama" album., He rejoined Soilwork in 2008 and played on 2010s The Panic Broadcast and in June 2012 he quit Soilwork for the second time. After leaving Soilwork, he filled in for Adam Dutkiewicz when he was injured on Killswitch Engage\'s European tour. More recently, he has collaborated with singers from across the melodic death metal genre including Anders Fridén, former band mate Björn "Speed" Strid and John Bush (vocalist of Anthrax) to make a CD much in the same style as "Roadrunner United", entitled "Nuclear Blast All-Stars". He also co-wrote Warrel Dane\'s solo record "Praises to the War Machine".', 'title': 'Peter Wichers'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Into The Mirror Live / Black Reflections is live promotional EP of the band Sanctuary recorded on May 12, 1990 at The Country Club in Reseda, California, during their "Into the Mirror Black" tour. Approximately 1000 CD copies of this were made and less than 500 were ever distributed to radio stations and record stores. Because of contractual problems with Epic Records, the full version was never released for public consumption. Epic Records destroyed 500+ copies of this CD. Warrel Dane has stated on several occasions that he has the master tapes and copyrights of the full show and intended to have it finally released. To date that has not happened. This CD has been heavily pirated over the years as a 2-on-1 CD with the Satan\'s Host "Metal From Hell" album on the notorious Reborn Classics record label.', 'title': 'Into the Mirror Live'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Eielson Air Force Base (AFB) (IATA: EIL,\xa0ICAO: PAEI,\xa0FAA LID: EIL) is a United States Air Force base located approximately 26 miles (42\xa0km) southeast of Fairbanks, Alaska and just southeast of Moose Creek, Alaska. It was established in 1943 as Mile 26 Satellite Field and taken off deployment in 2007. It has been a Superfund site since 1989.', 'title': 'Eielson Air Force Base'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'On 14 February 1950, a Convair B-36B, Air Force Serial Number "44-92075" assigned to the 7th Bomb Wing at Carswell Air Force Base, crashed in northern British Columbia after jettisoning a Mark 4 nuclear bomb. This was the first such nuclear weapon loss in history. The B-36 had been en route from Eielson Air Force Base near Fairbanks, Alaska to Carswell AFB in Fort Worth, Texas, more than 3000 miles south-east, on a mission that included a simulated nuclear attack on San Francisco.', 'title': '1950 British Columbia B-36 crash'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The 343d Wing is an inactive United States Air Force unit. Its last assignment was with Pacific Air Forces at Eielson Air Force Base, Alaska, where it was inactivated on 20 August 1993. The unit was formed at Eielson as the 343d Composite Wing and activated in October 1981 to replace the 5010th Combat Support Group. It operated both fighter and forward air control aircraft. In 1991, it also became the administrator for periodic Exercise Cope Thunder operations, which moved to Alaska from the Philippines after the eruption of Mount Pinatubo resulted in the evacuation of units from Clark Air Base When the wing was inactivated, it was replaced at Eielson by the 354th Fighter Wing.', 'title': '343d Wing'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The 168th Air Refueling Squadron (168 ARS) is a unit of the Alaska Air National Guard 168th Air Refueling Wing located at Eielson Air Force Base, Fairbanks, Alaska. The 168th is equipped with the KC-135R Stratotanker.', 'title': '168th Air Refueling Squadron'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Exercise Red Flag is an advanced aerial combat training exercise hosted at Nellis Air Force Base, Nevada. Red Flag – Alaska is held at Eielson Air Force Base, Alaska, being a successor to the previous COPE THUNDER exercise series in the Western Pacific and Alaska. Since 1975, air crews from the United States Air Force (USAF), United States Navy (USN), United States Marine Corps (USMC), United States Army (USA) and numerous NATO or other allied nations' air forces take part in one of several Red Flag exercises held during the year, each of which is two weeks in duration.", 'title': 'Exercise Red Flag'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Carl Benjamin "Ben" Eielson (July 20, 1897 – November 9, 1929) was an American aviator, bush pilot and explorer. Eielson Air Force Base in Alaska is named in his honor.', 'title': 'Carl Ben Eielson'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Political party strength in Alaska has varied over the years. The communities of Juneau, Sitka, downtown and midtown Anchorage, the areas surrounding the College/University of Alaska Fairbanks campus and Ester and the "Alaska Bush" – rural, sparsely populated Alaska – stand out as Democratic strongholds, while the Kenai Peninsula, Matanuska-Susitna Valley, parts of Anchorage, and Fairbanks (including North Pole and Eielson Air Force Base), Ketchikan, Wrangell, and Petersburg serve as the Republican Party electoral base. As of 2004, well over half of all registered voters have chosen "Non-Partisan" or "Undeclared" as their affiliation, despite recent attempts to close primaries.', 'title': 'Politics of Alaska'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Cape Thompson is a headland on the Chukchi Sea coast of Alaska. It is located 26 miles to the southeast of Point Hope, Arctic Slope. It is part of the Chukchi Sea unit of Alaska Maritime National Wildlife Refuge.', 'title': 'Cape Thompson'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Alaska Railroad (reporting mark ARR) is a Class II railroad which extends from Seward and Whittier, in the south of the state of Alaska, in the United States, to Fairbanks (passing through Anchorage), and beyond to Eielson Air Force Base and Fort Wainwright in the interior of that state. Uniquely (for the US), it carries both freight and passengers throughout its system, including Denali National Park. The railroad has a mainline over 470 mi long and is well over 500 mi including branch lines and siding tracks. It is currently owned by the state of Alaska. The railroad is connected to the contiguous 48 via three rail barges that sail between the Port of Whittier, Alaska and Harbor Island in Seattle (the Alaska Railroad-owned Alaska Rail Marine, from Whittier to Seattle, and the CN Rail-owned Aqua Train, from Whittier to Prince Rupert, British Columbia) but does not currently have a direct, land-based connection with any other railroad lines on the North American network. In 2016, the company suffered a net loss of $4.3 million on revenues of $169.8 million, holding $1.1 billion in total assets.', 'title': 'Alaska Railroad'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Moose Creek is a census-designated place (CDP) in Fairbanks North Star Borough in the U.S. state of Alaska. As of the 2010 census, the population of the CDP was 747. It is part of the 'Fairbanks, Alaska Metropolitan Statistical Area'. Moose Creek is located south of Fairbanks, Alaska along the Richardson Highway. Moose Creek is bordered by Eielson Air Force Base to the south, the Tanana River to the west, and the Chena River Flood Control Project to the north.", 'title': 'Moose Creek, Alaska'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Magic Christmas Tree is a 1964 American Christmas-themed fantasy-adventure film about a boy who uses a magic ring to bring a Christmas tree to life. The tree then grants the boy three wishes.', 'title': 'The Magic Christmas Tree'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Christmas Tree is a 1996 American made-for-television Christmas drama film directed by Sally Field, starring Julie Harris and Andrew McCarthy and produced by Walt Disney Television which premiered on ABC on December 22, 1996.', 'title': 'The Christmas Tree (1996 film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Weekend at Bernie's is a 1989 American comedy film written by Robert Klane and directed by Ted Kotcheff. The film stars Andrew McCarthy and Jonathan Silverman as young insurance corporation employees who discover their boss, Bernie, dead. While attempting to convince people that Bernie is still alive, they discover that Bernie had ordered their deaths to cover up his embezzlement.", 'title': "Weekend at Bernie's"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Lisa Lucas is a former child actress best known for her role as "Addie Mills" in the Emmy-winning Christmas television special, "The House Without a Christmas Tree". It first aired on CBS-TV in December 1972, spawned three holiday-based sequels from 1973–1976 with the same cast, "The Thanksgiving Treasure" (also listed elsewhere as "The Holiday Treasure") (1973), "The Easter Promise" (1975) and "Addie and The King of Hearts" (1976). " USA Today" called "A House Without a Christmas Tree" "beautifully acted" and the "Spartanburg Herald-Journal" called it a "Christmas treasure" and said it was full of heartwarming moments, especially when Addie gives away the Christmas tree she wins, or finds the star belonging to her mother.', 'title': 'Lisa Lucas'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Night of the Running Man is a 1995 American crime thriller directed by Mark L. Lester and written by Lee Wells, who adapted it from his novel of the same name. It stars Andrew McCarthy and Scott Glenn. The film debuted on HBO before being released direct-to-video. McCarthy plays a cab driver who stumbles upon a large sum of money stolen from the mob. When mob hit men target him, he flees.', 'title': 'Night of the Running Man'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Beniker Gang is a 1985 American drama film written by Judie Angell and directed by Ken Kwapis. The movie stars Andrew McCarthy as Arthur Beniker, Jennifer Dundas as Cassie Beniker, Charles Fields as Edmund Beniker, and Danny Pintauro as Ben Beniker.', 'title': 'The Beniker Gang'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Less Than Zero is a 1987 American drama film very loosely based on Bret Easton Ellis' novel of the same name. The film stars Andrew McCarthy as Clay, a college freshman returning home for Christmas to spend time with his ex-girlfriend Blair (Jami Gertz) and his friend Julian (Robert Downey, Jr.), who is also a drug addict. The film presents a look at the culture of wealthy, decadent youth in Los Angeles.", 'title': 'Less Than Zero (film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Mannequin is a 1987 American romantic comedy fantasy film starring Andrew McCarthy, Kim Cattrall, Meshach Taylor, James Spader, G. W. Bailey, and Estelle Getty. Directed and written by Michael Gottlieb, the film was also co-written by Edward Rugoff. The original music score was composed by Sylvester Levay. The film, a modern re-telling of the Pygmalion myth, tells about a chronically underemployed artist named Jonathan Switcher (played by Andrew McCarthy) who gets a job as a department-store window dresser and falls in love with a mannequin (played by Kim Cattrall)—the attraction being that she comes to life on occasion, but only for him.', 'title': 'Mannequin (1987 film)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Julia Ann "Julie" Harris (December 2, 1925 – August 24, 2013) was an American stage, screen, and television actress. A 10-time Tony Award nominee and five-time winner, she won for "I Am a Camera" (1952), "The Lark" (1956), "Forty Carats" (1969), "The Last of Mrs. Lincoln" (1973), and "The Belle of Amherst" (1977). She also won three Emmy Awards, a Grammy Award, and was nominated for the Academy Award for Best Actress for the 1952 film "The Member of the Wedding". She was inducted into the American Theatre Hall of Fame in 1979, received the National Medal of Arts in 1994, and the 2002 Special Lifetime Achievement Tony Award.', 'title': 'Julie Harris (actress)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Tree" was a controversial 24 m high inflatable sculpture by the artist Paul McCarthy that was briefly installed in the Place Vendôme in Paris in October 2014 as part of a FIAC exhibition called "Hors les murs". Although officially described as a Christmas tree, it was widely criticised for its similarity in appearance to a huge green butt plug. McCarthy admitted that it was deliberately shaped as such as a joke.', 'title': 'Tree (installation)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Black Country Rangers Football Club is a football club based in Rowley Regis in the West Midlands. They are currently members of the West Midlands (Regional) League Premier Division and play at the Beeches in Cradley, groundsharing with Cradley Town.', 'title': 'Black Country Rangers F.C.'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Lichfield Cathedral is situated in Lichfield, Staffordshire, England. It is the only medieval English cathedral with three spires. The Diocese of Lichfield covers all of Staffordshire, much of Shropshire and part of the Black Country and West Midlands. The 99th and current Bishop of Lichfield is Michael Ipgrave who was appointed on 10 June 2016.', 'title': 'Lichfield Cathedral'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Ryan's Gig Guide is an independent incisive band friendly gig guide and music magazine based in The Black Country, England and distributed throughout the West Midlands United Kingdom. The printed publication is not just a list of gigs each month, but the finger on the pulse of the Birmingham and the Black Country music scene.", 'title': "Ryan's Gig Guide"}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Minster Pool is a reservoir located between Bird Street and Dam Street in the heart of the city of Lichfield, Staffordshire in the United Kingdom. The pool lies directly south of Lichfield Cathedral and historically has been important to the defence of the Cathedral Close. The pool was originally formed in the 11th century when a boggy stream was dammed at its eastern end to drive a mill on Dam Street. The pool was used as a mill pond and fishery until 1856 when the mill was demolished; it has since been retained for public amenity.', 'title': 'Minster Pool'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Brierley Hill is a small town and electoral ward of the Dudley Metropolitan Borough, in the West Midlands of England, and is situated approximately 2.5 miles south of central Dudley and 2 miles north of Stourbridge. Part of the Black Country, and in a heavily industrialised area of the Dudley Borough, it has a population of 13,935 at the 2011 census, and is best known for glass and steel manufacturing, although the industry has declined considerably since the 1970s. One of the largest factories in the area was the Round Oak Steelworks, which was closed down and redeveloped in the 1980s to become the Merry Hill Shopping Centre. Brierley Hill was originally in Staffordshire, but is now part of the West Midlands metropolitan county since its creation in 1974.', 'title': 'Brierley Hill'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Black Country Living Museum (formerly The Black Country Museum) is an open-air museum of rebuilt historic buildings in Dudley in the West Midlands of England. It is located in the centre of the Black Country, 10 miles west of Birmingham. The museum occupies 105000 m2 of former industrial land partly reclaimed from a former railway goods yard, disused lime kilns, canal arm and former coal pits.', 'title': 'Black Country Living Museum'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "This is a list of railway stations within the West Midlands, a metropolitan county in central England which includes the cities of Birmingham, Coventry and Wolverhampton. It includes all railway stations in the West Midlands that currently have regular timetabled train services, as well as certain stations outside the county which are within the area supported by Transport for West Midlands (TfWM), formerly known as Centro. Transport within the West Midlands is subsidised by TfWM, who since 2006 have used the brand name Network West Midlands to demonstrate the 'joined-up' nature of the regions bus and rail networks.", 'title': 'List of railway stations in the West Midlands'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Walsall ( ) is an industrial town in the West Midlands of England. It is located 8 miles north-west of the City of Birmingham and 6 miles east of the City of Wolverhampton. Historically a part of Staffordshire, Walsall is a component area of the West Midlands conurbation, and part of the Black Country.', 'title': 'Walsall'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Dudley Zoological Gardens is a 40 acre zoo located within the grounds of Dudley Castle in the town of Dudley, in the Black Country region of the West Midlands, England. The Zoo opened to the public on 18 May 1937. Dudley Zoo is owned and operated by Dudley and West Midlands Zoological Society, founded in 1935 and a registered charity.', 'title': 'Dudley Zoo'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Tipton is a town in the borough of Sandwell, West Midlands, England, with a population of around 38,777 at the 2011 UK Census. Tipton is located about halfway between Birmingham and Wolverhampton. It is a part of the West Midlands conurbation and is a part of the Black Country.', 'title': 'Tipton'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'High performance sport or elite sport is sport at the highest level of competition, with elite athletes as the competitors. In sports administration "high performance sport", where the emphasis is on winning prestigious competitions, is distinguished from "mass sport" or "recreational sport", where the emphasis is on attracting the maximum number of participants. High performance sport overlaps with professional sport but is not the same; for example, the English football league system and Minor League Baseball include lower divisions whose teams\' members are full-time professionals; on the other hand, competitors at the Olympic Games or World Games in some minority sports may be part-time or rely on government grants.', 'title': 'High performance sport'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Idrottsklubben Brage, also known as IK Brage or simply Brage, is a Swedish football club located in Borlänge. The club is affiliated with Dalarnas Fotbollförbund and play their home games at Domnarvsvallen. The club colours, reflected in their crest and kit, are green and white. The club can be seen as a continuation of IK Blixt which was founded in the early 1920s but merged into Domnarvets GoIF in 1923. Two years later the merger was split and IK Blixt changed their name to IK Brage. The club has played a total of 18 seasons in Allsvenskan, which is the highest level of the Swedish football league system. They currently play in the third highest level (Division 1) where the season lasts from April to November. IK Brage also recently spent time in the second division Superettan and fourth division Division 2 between 2005 and 2009) but has mainly played in the two highest Swedish divisions since its foundation.', 'title': 'IK Brage'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Pakistan Super League (PSL, Urdu: \u200e ) is a men's professional Twenty20 cricket league, sanctioned by the Pakistan Cricket Board, that represents the sport's highest level in Pakistan. The league was founded in Lahore on 8 September 2015 and presently comprises of 6 teams. Instead of operating as an association of independently owned teams, the league is a single entity in which each franchise is owned and controlled by investors. The commercial rights to the initial franchises were sold for ₨985 crore ($91.4 million) for a span of 10 years in December 2015. The PSL season runs through the month of February, with each team playing 10\xa0matches in double round-robin format; the top 4 teams with the best record qualify for the Playoffs and culminates in the championship game, the PSL Cup Final. The league's head offices are directed out of the Pakistan Cricket Board head office in Lahore. Due to the security reasons, the first season was played entirely in the United Arab Emirates. The inaugural champions were Islamabad United. Peshawar Zalmi were the 2017 PSL Champions, having defeated Quetta Gladiators in Lahore on 5 March 2017.", 'title': 'Pakistan Super League'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Taylor Eric Kemp (born July 23, 1990) is an American soccer player currently playing for D.C. United in Major League Soccer.', 'title': 'Taylor Kemp'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Honkbal Overgangsklasse (Dutch for "Baseball Transition League") is the second highest level of professional baseball in the Netherlands. It is a twelve-team league that plays a 22-game schedule followed by two separate 15-game schedules for the best six teams and the weakest six teams, and is overseen by the KNBSB. Games are played principally on weekends. The season runs from April to August and is followed by a promotion and relegation system with the highest level of baseball in the Netherlands, the Honkbal Hoofdklasse, so that the composition of the top level may change from year to year.', 'title': 'Honkbal Overgangsklasse'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Major League Soccer (MLS) is a men's professional soccer league, sanctioned by U.S. Soccer, that represents the sport's highest level in both the United States and Canada. MLS constitutes one of the major professional sports leagues of the United States and Canada. The league comprises 22 teams—19 in the U.S. and 3 in Canada. The MLS regular season runs from March to October, with each team playing 34\xa0games; the team with the best record is awarded the Supporters' Shield. The postseason includes twelve teams competing in the MLS Cup Playoffs through November and December, culminating in the championship game, the MLS Cup. MLS teams also play in other domestic competitions against teams from other divisions in the U.S. Open Cup and in the Canadian Championship. MLS teams also compete against continental rivals in the CONCACAF Champions League.", 'title': 'Major League Soccer'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Galleria at Tyler, formerly known as the Tyler Mall, is a regional shopping mall located in Riverside, California, United States. Initially a single story facility, with three two-story anchor tenants, the mall was renovated in 1991 to add a second level and a fourth anchor tenant, Nordstrom. Nordstrom is the only tenant in this mall that has a third level besides Forever 21.', 'title': 'Galleria at Tyler'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The National Women's Soccer League (NWSL) is a professional women's soccer league, run by the United States Soccer Federation. At the top of the United States league system, it represents the sport's highest level in the United States. The NWSL was established in 2012 as a successor to Women's Professional Soccer (2007–2012) which was the successor to Women's United Soccer Association (2001–2003). The league began play in 2013 with eight teams; four of which were former members of Women's Professional Soccer. With the addition of two expansion teams in Houston and Orlando since the league's founding, it now has 10 teams based throughout the United States.", 'title': "National Women's Soccer League"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Carlos Emilio Carmona Tello (born February 21, 1987) is a Chilean professional footballer who plays for Atlanta United as a midfielder in the Major League Soccer (MLS) men's professional soccer league, sanctioned by U.S. Soccer, that represents the sport's highest level in both the United States and Canada.", 'title': 'Carlos Carmona'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Bangladesh Super League (BSL) is a defunct professional football league, sanctioned by Bangladesh Football Federation, that represents the sport's highest level in Bangladesh. It is the country's premier football division and is the top of the Bangladesh football league system. The league was inaugurated by Bangladesh Football Federation on 18 January 2016. The league will be contested by eight clubs. The first season of the league will be held in 2017. Due to less stadiums and infrastructure, the tournament has been cancelled without any press release.", 'title': 'Bangladesh Super League'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '14:59 is the third studio album by American rock band Sugar Ray, released on January 12, 1999. It entered the top 20 on the "Billboard" 200, peaking at number 17<ref name="1459/billboard"> </ref> and certified triple-platinum by the RIAA. The album shows the band moving into a more mainstream pop rock sound, away from their earlier funk metal and nu metal sound, due to the success of their single "Fly" off their prior album, "Floored". The album\'s title is a self-deprecating reference to the "15 minutes of fame" critics claimed the band was riding on.', 'title': '14:59'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Reel Big Fish is an American ska punk band from Huntington Beach, California, best known for the 1997 hit "Sell Out". The band gained mainstream recognition in the mid-to-late 1990s, during the third wave of ska with the release of the gold certified album "Turn the Radio Off". Soon after, the band lost mainstream recognition but gained an underground cult following. As of 2006, the band is no longer signed to a major record label, and has since been independent. After many line-up changes throughout the years, front man Aaron Barrett remains the only founding member in the band.', 'title': 'Reel Big Fish'}
