 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Sugar Ray is an American rock band formed in 1986. The band, starting off more as a funk metal band, gained mainstream fame in 1997 with their release of the song "Fly". This song\'s success, coupled with its pop rock sound that was quite different from the rest of their material at the time, led the band to change to a mainstream, pop music style. Subsequent albums shared this style, and the band landed a number of hits with "Every Morning" and "Someday" from "" and "When It\'s Over" from their self-titled album.', 'title': 'Sugar Ray'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Faruq Mahfuz Anam (Bengali: ফারুক মাহফুজ আনাম ), (known by his stage name James) is a Bangladeshi singer, guitarist, and composer. He is often referred to as "Guru". James is currently the lead guitarist and vocalist of the band "Nagar Baul" (the Urban Medincant). He has also played back in few songs in Bollywood movies. James rose to mainstream fame in the 1990s as the frontman of "Feelings" now renamed "Nagar Baul" which is one of the "Big Three of Rock", who were responsible for developing and popularising rock music in Bangladesh, the other two being LRB and Ark. James is considered to be the pioneer of psychedelic rock in Bangladesh.', 'title': 'James (musician)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"When It\'s Over" is a song by American rock band Sugar Ray and it was released in May 2001 as the lead single from their self-titled fourth album "Sugar Ray". The song reached number 6 in New Zealand, number 13 on the "Billboard" Hot 100 and number 32 on the UK Singles Chart.', 'title': "When It's Over (Sugar Ray song)"}]

