 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Eric Thomas Bolling (born March 2, 1963) is an American television personality, conservative political commentator, author, and financial commentator. He has occupied numerous roles as a commentator on financial issues for television, most notably for Fox News. Bolling took over as host of the Fox Business Channel news program "Cashin\' In" in 2013. He was a co-host of Fox News Channel\'s "The Five" at its inception, until leaving to co-host "Fox News Specialists" in May 2017. In 2016, Bolling published his first book, "Wake Up America", which became a "New York Times" best seller. In 2017 he wrote another book, "The Swamp: Washington\'s Murky Pool of Corruption and Cronyism and How Trump Can Drain It". On August 5, 2017, "HuffPost" reported that he had sent unsolicited lewd photographs and text messages to three female colleagues several years previously. Fox News conducted an independent investigation and mutually agreed to part ways with Bolling the following month.', 'title': 'Eric Bolling'}
