 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Tracy Byrnes (born 1970) is an American television business news anchor, journalist, and accountant who worked for the Fox Business Network. Byrnes appeared as a recurring panelist on Fox Business Channel stocks and investment news programs "Cashin\' In", "Bulls & Bears" and "Your World with Neil Cavuto". She formerly hosted the 1 P.M. ET weekday "FBN Live" on FoxNews.com Live. She joined Fox Business Network as a reporter in October 2007 after being a recurring guest since 2005. She left Fox Business Network in March 2015.', 'title': 'Tracy Byrnes'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The Fox News Specialists is an American news and talk show that aired from May 1 to September 7, 2017, on the Fox News Channel. It featured three permanent hosts, Eric Bolling, Katherine Timpf, and Eboni Williams, plus two rotating guests, who are called specialists, who discuss current events and political issues. It was created to replace "The Five", that Bolling used to be a co-host for, due to that show moving to 9pm ET, in the wake of Bill O\'Reilly being forced out at Fox News. The first two guest co-hosts for the first episode were Dallas Mavericks owner Mark Cuban and television producer Mark McKinnon. The first episode also featured an interview, conducted by Bolling, with the President of the United States, Donald Trump.', 'title': 'Fox News Specialists'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Saif Ali Khan (] ; born Sajid Ali Khan on 16 August 1970) is an Indian film actor and producer. The son of actress Sharmila Tagore and the late cricketer Mansoor Ali Khan Pataudi, Khan made his acting debut in Yash Chopra\'s unsuccessful drama "Parampara" (1993), but achieved success with his roles in the romantic drama "Yeh Dillagi" and the action film "Main Khiladi Tu Anari" (both 1994). Khan\'s career prospect declined through much of the 1990s, and his biggest commercial success of the decade came with the ensemble drama "Hum Saath-Saath Hain" (1999). He rose to prominence with roles in two ensemble comedy-dramas"Dil Chahta Hai" (2001) and "Kal Ho Naa Ho" (2003).', 'title': 'Saif Ali Khan'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Rafael Abad Anselmo (born in Seville, Spain on December 23, 1981) better known by his stage name Rasel, is a Spanish singer, with various influences including rap, reggae, R&B and dance music. His debut was with "Publicidad engañosa" in 2007. His biggest commercial success is the 2012 hit "Me pones tierno" featuring Carlos Baute reaching #6 on the Spanish Singles Chart. He is signed to Warner Music.', 'title': 'Rasel'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'American actress Zooey Deschanel made her film debut in the 1999 comedy feature "Mumford". She went on to gained public attention by co-starred in the comedy-drama "Almost Famous" (2000), the independent drama "Manic" (2001), opposite Joseph Gordon-Levitt, and the comedy-drama "The Good Girl" (2002). She landed her first major role as a 18-year-old virgin in the romantic drama "All the Real Girls" (2003), for which she was nominated for an Independent Spirit Award for Best Female Lead. Deschanel\'s biggest commercial success, as of 2017, came with the Christmas-fantasy film "Elf" (also in 2003), which grossed over $220 million worldwide.', 'title': 'Zooey Deschanel filmography'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Chloe is a 2009 erotic thriller film directed by Atom Egoyan, a remake of the 2003 French film "Nathalie...". It stars Julianne Moore, Liam Neeson, and Amanda Seyfried in the title role. Its screenplay was written by Erin Cressida Wilson, based on the earlier French film, written by Anne Fontaine.', 'title': 'Chloe (film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Self Control is the third album by American singer Laura Branigan, released in 1984. Two songs from the album were US Top-20 hits, the title song (#4) and "The Lucky One" (#20). The album became Branigan\'s biggest commercial success, earning her a Platinum certification in the United States for over 1 million confirmed sales, and selling several million copies worldwide. Branigan also enjoyed huge success in some countries with the single "Ti amo" (her second Umberto Tozzi cover, after "Gloria"), which reached #5 in the Canadian singles chart, but most notably reaching #2 in Australia. The album was a huge success internationally, gaining several sales certifications.', 'title': 'Self Control (album)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'For Those Who Think Young, appearing on the album cover as (for those who think young) and originally to be entitled for those who think jung, was the third album by Canadian new wave band Rough Trade; it was released in 1981 (True North TN-48 in Canada; Boardwalk NB-33261-1, US; Big Time, UK; CBS 85385, The Netherlands). It climbed to #9 in Canada on the "RPM" Top 50 Albums Chart on November 7, 1981 (putting it at #1 on the CANCON Chart listing), and held the position for three weeks, dropping out of the Top 50 after sixteen weeks on February 6 of the following year. It was certified gold in Canada by the CRIA on November 1, 1981. The single "All Touch" gave the band its biggest commercial success, reaching #12 in Canada on the "RPM" Top 50 Singles Chart (#2 on the CANCON Chart) and #58 on the U.S. ""Billboard" Hot 100".', 'title': 'For Those Who Think Young (album)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Michael Gordon Oldfield (born 15 May 1953) is an English musician and composer. His work blends progressive rock with world, folk, classical, electronic, ambient, and new-age music. His biggest commercial success is the 1973 album "Tubular Bells"which launched Virgin Records and became a hit in America after its opening was used as the theme for the film "The Exorcist". He recorded the 1983 hit single "Moonlight Shadow" and a rendition of the Christmas piece "In Dulci Jubilo".', 'title': 'Mike Oldfield'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'John Dunning (April 27, 1927–September 19, 2011) was a pioneering Canadian film producer from Montreal who co-founded the Canadian film production company Cinépix and produced early works by notable Canadian directors David Cronenberg and Ivan Reitman. Dunning launched Cinépix with partner André Link in Montreal in the early 1960s. Their biggest commercial success—and the first Canadian box office hit—came with Reitman’s "Meatballs" (1979).', 'title': 'John Dunning (film producer)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Atom Egoyan, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (born July 19, 1960) is a Canadian stage and film director, writer and producer. Egoyan made his career breakthrough with "Exotica" (1994), a film set primarily in and around the fictional Exotica strip club. Egoyan\'s most critically acclaimed film is the drama "The Sweet Hereafter" (1997), for which he received two Academy Award nominations, and his biggest commercial success is the erotic thriller "Chloe" (2009).', 'title': 'Atom Egoyan'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Neethu (born 2 September 1986) is an Indian film actress, who predominantly appears in Kannada-language films and few Tulu and Malayalam films. Her commercial successful movies include Joke Falls (2004), Beru (2005), Photographer (2006) - Malayalam debut, Koti Chennaya (2007), Gaalipata (2008)- (her biggest commercial success up to date.) , Krishna Nee Late Aagi Baaro (2009) and many others. She has done cameos in other successful movies like Abhinetri (2015 film) and Fair & Lovely. Her career include working with actors like Ramesh Aravind, V. Ravichandran, Mohanlal, H. G. Dattatreya, Kishore Kumar G, Ganesh, Jaggesh, Doddanna, Anant Nag, Vijay Raghavendra, Ravishankar Gowda, Dileep Raj, Rajesh Krishnan, Shivadhwaj shetty, Diganth, Mohan Shankar, Naveen Krishna.', 'title': 'Neethu'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Ioanna-Maria Gertsou was born on January 20, 1979 in Athens Greece and she is visually impaired due to retinopathy of prematurity. She is mostly known as representative of the guide dog movement, through "Lara Guide-Dog School Hellas" a non - profit organisation that she co-founded in 2008. She is an activist, promoting human diversity, guide dog access, physical and electronic accessibility and animal rights. She is also a scientist with superior studies in experimental psychology and cognitive science. From 2006 to 2012, she worked as a researcher in the Human/computer Interaction Laboratory, located at the Foundation of Research and Technology Hellas (F.O.R.T.H.) which is considered to be a major scientific center worldwide. In 2008, during a visit at F.O.R.T.H the President of the Hellenic Republic, Karolos Papoulias was moved by her presentation and did something extraordinary: he bowed and kissed her hand to show his respect. Ioanna-Maria is one among the very few visually impaired / disabled researchers around the world and the only one, employed in Greece. Additionally, she is considered to be a rare case of a person who is blind since birth to exhibit visual synaesthesia. That is why, she is being asked to contribute to experiments, studies and projects regarding perception and the crossing of the senses. Every year, she is invited and participates in numerous conferences, arising matters varying from psychological research to guide dogs and contemporary issues as youth unemployment., Her knoweledge in psychology is often shared on newspapers and blogs. She was the first person to enter with her guide dog (and a dog in general), into the Hellenic Parliament and the European Parliament. In 2009, she protested through the web because her guide dog was denied in two reustaurants. She wrote a letter which went viral and caused great awareness. Following this incident, one year later a Spanish tourist named Antonia Pons Losada was not permitted into the new Acropolis Museum with her guide dog. As a result of local and international outcry regarding issues of guide dog access in Greece on August 2010, Ioanna contributed to the voting of the first national law, related to guide dogs. As soon as the law was approved by the Hellenic Parliament, she took her guide dog "May" and a Television crew for a visit to the Acropolis Museum. Today on the Museum\'s website we are informed that "guide and assistance dogs, are welcome". According to the law 3868/2010, guide, assistance and therapy dogs are allowed practically everywhere in Greece. The law was recently reviewed, including guide/assistance/therapy dogs who are still in training and claryfing that they can enter into transportation means, without a muzzle. While transforming Greece into a role model for guide dog access, she joined the board of directors of the European Guide Dog Federation to defend the rights and access of guide dog teams, throughout the European Union. In 2013 at the European Parliament, she and former MEP Jorgo Chatzimarkakis were the main rapporteurs for the voting of an E.U. direction, aiming to promote e-accessibility on governmental websites. The direction was approved in 2014. Ioanna-Maria, was two times a political candidate. One in the 2009 Hellenic National Elections with the Ecogreens Party and one in the 2014 European Elections with the "Greek European Citizens Party". She was a paracycling athlete. Always accompanied by her two guide dogs "Lara" and "May", she had appeared on several documentaries, TV shows, movies and public events., The references are mainly in Greek.', 'title': 'Ioanna-Maria Gertsou'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Katarina Asplund (1690-1758), was a Finnish pietist. She was a leading figure within the pietism movement in Österbotten and known as a visionary. Because of her visionary activity, she was often in conflict with the authorities on charges of blasphemy.', 'title': 'Katarina Asplund'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Hohn Air Base is a military air base in Germany. It is home to the "Lufttransportgeschwader" 63 (LTG 63 for short, Air Transport Wing 63 in English) of the German Air Force ("Luftwaffe"). Since May 1968 the Transall C-160 is operated from the base. During 2013 Air Transport Wing 63 will disband and subsequently the air base will be given up by the German Air Force. The LTG63 is in charge until 2020 (today\'s plan)', 'title': 'Hohn Air Base'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Fist of Fury 1991 (新精武門1991) is a 1991 Hong Kong comedy film directed by Cho Chung-sing, and starring Stephen Chow in the lead role. Aside from a few parodied scenes, the film bears no other similarities to the Bruce Lee film, "Fist of Fury", except in title only. A sequel, "Fist of Fury 1991 II", was released the following year.', 'title': 'Fist of Fury 1991'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Antic Cafe (アンティック-珈琲店- , Antikku Kafe , nicknamed An Cafe) is a Japanese pop rock band formed in 2003 and signed to Sony Music Japan. Their visual image is oshare kei, and they describe their music as "Harajuku Dance Rock". The group has released five full-length albums, one compilation album, and four EPs. On September 1, 2009, the band announced that after their live show on January 4, 2010 at the Nippon Budokan, they would suspend activities and put the group on hiatus, however they stated they will not disband. On April 1, 2012, after two-year break, the team announced the resumption of activity.', 'title': 'An Cafe'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Tess Amber Adler (born February 11, 1990), commonly known as Tess Taylor, is an American reality television personality and model known for her show "Pretty Wild" with her adopted sisters Gabby and Alexis Neiers. She became "Playboy"\' s Cyber Girl of the Year in 2010, modelling for "Playboy" under the name Tess Taylor Arlington.', 'title': 'Tess Taylor'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Tess Asplund, born 1974, is a Swedish activist who gained attention following her protest against neo-Nazis in Borlänge, Sweden. David Lagerlof is the photographer of the viral image of Asplund, which shows her facing uniformed members of the Swedish Nordic Resistance Movement with her fist in the air. She is originally from Colombia and describes herself as Afro-Swedish. About the incident, Asplund is quoted as having said “If this picture of me can get more people to dare to show resistance, then it’s all good...the people must unite and show that it is not okay that racism is becoming normalised and that fascists are running around on our streets.”', 'title': 'Tess Asplund'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Fliegerfaust (lit. "pilot fist" or "plane fist"), also known as the "Luftfaust" (lit. "air fist"), was a prototype unguided, man-portable, German multi-barreled ground-to-air rocket launcher, designed to destroy enemy ground attack planes.', 'title': 'Fliegerfaust'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The Nordic Resistance Movement (Swedish: "Nordiska Motståndsrörelsen; NMR" , Norwegian: "Nordiske motstandsbevegelsen; NMB" , Finnish: "Pohjoismainen vastarintaliike; PVL" , Danish: "Nordiske modstandsbevægelse; NMB" ) is a Nordic Neo-Nazi movement that exists in Sweden, Finland, and Norway. It had a branch in Denmark before it was disbanded for inactivity in 2016.', 'title': 'Nordic Resistance Movement'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Brand Content Management (BCM) is a concept that creates a standard process an organization can use to create, store, and distribute brand-related marketing materials and information. Organizations such as AT&T, Coca-Cola, Starbucks, Apple, and Harley-Davidson all participate in marketing development and distribution of their marketing concepts. Each of these organizations have created a process to store and control their brand image and marketing concepts. Brand-related marketing advertisements contain copyrighted and trademarked information. These organization produce hundreds of thousands of marketing pieces (content) each year, some examples of these assets are lifestyle photography, brochures, literature, and logos. Marketing organizations develop these assets for mass distribution through many channels and segments. These can become viral, video, print, image, digital/electronic, or broadcast. These types of organizations generally use a customer relationship management (CRM) application that allows organizations greater control over the creative development, distribution, fulfillment and management of all brand-related content.', 'title': 'Brand content management'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Lianjiang River (), anciently kown as Huang River (), is a right-bank and the largest tributary of the North River in Guangdong. The river rises in Momianshi (磨面石) of Xingzi Town (星子镇) in Lianzhou county, and it runs generally northwest to southeast through Lianzhou, Yangshan and Yingde counties. It joins the Bei River at Jiangkouzui of Lianjiangkou Town (连江口镇), Yingde. The Lianjiang River has a length of 275 km , with its tributaries; it has a drainage basin area of 10,061 km2 .', 'title': 'Lianjiang River'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Guangdong Dongguan Bank (official name), also known as Guangdong Hongyuan Southern Tigers () or Guangdong Southern Tigers, are a Chinese professional basketball team owned by the Guangdong Winnerway (Hongyuan) Group. The team is one of the best-performing teams in the Chinese Basketball Association, or CBA. The Tigers have won eight CBA titles, tying only the Bayi Rockets' eight titles. The Tigers are the only team to have qualified for the CBA playoffs in all the seasons since the league launched in 1995. The team plays its home games in Dongguan, Guangdong. Occasionally, for marketing purpose, the team diversifies some of its home games to Zhongshan, Zhuhai, and other cities in the Pearl River Delta.", 'title': 'Guangdong Southern Tigers'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Chengbei Subdistrict () is a subdistrict of Lianjiang in southwestern Guangdong, People's Republic of China, occupying the northern portion of the urban area of Lianjiang as suggested by its name. , it has 2 residential communities (社区) and 3 villages under its administration.", 'title': 'Chengbei Subdistrict, Lianjiang, Guangdong'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Macheng () is a city in northeastern Hubei province, People's Republic of China, bordering the provinces of Henan to the north and Anhui to the northeast. It is a county-level city under the administration of Huanggang City and abuts the south side of the Dabie Mountains. The city's administrative area covers about 3600 km2 , and includes some 700 villages and small towns. Total population was 1.2 million at the last census.", 'title': 'Macheng'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "There is no distinct rule in the distribution of stone dogs. Most of them are scattered in the coastal areas of the Leizhou Peninsula, especially in Zhanjiang City, Xuwen County, Haikang County, Lanjiang City, Suixi County and many other small rural villages' entrances, corners, gates, ponds and the entrances of the houses and temples. They are famous in Chentown, Angle Tail Town, Longmen Town, QinDou Town, Lianjiang City, Hengshan Town, GoodDong Town, and Shuixi Jiang Hong Town because stone dogs of these cities are more completely preserved. The stone dogs in different regions come in different shapes, representing the evolution of the region. The discovery sites are historical, and may date back to the Qing Dynasty. According to the unofficial statistics Leizhou Peninsula has over a million stone dogs. The Leizhou Museum has collected nearly 500 stone dogs from the countryside, village corners, buried underground, or the villagers.", 'title': 'Stone dogs in the Leizhou Peninsula'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Hepu (), formerly romanized as Hoppo, Hopu or Hop\'u, is a county under the administration of Beihai City in southeastern Guangxi, China. It borders Lianjiang (Guangdong) to the southeast, Bobai County to the northeast, the Gulf of Tonkin to the south, Qinzhou to the west, and Pubei County to the north. Then-Premier Li Peng called this place "the Southern Pearl County" (南珠之乡) in November 1992. The county was once known as Lianzhou (Postal: Limchow). It has an area of 2380 km2 and a population of 930,914 .', 'title': 'Hepu County'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The 2010 Asian Games torch relay was held from October 12, 2010 through 21 cities in Guangdong province and 2 cities off Guangdong province before the opening ceremony on November 12, 2010. Prior to the relay, a lighting ceremony was held back on October 9, 2010. Some 2,068 torchbearers are expected to carry the torch with one of the relay was held in indoor arena. The relay in Harbin was held in the main venue of the 1996 Asian Winter Games, the Harbin Ice Hockey Rink, while the relay on October 22, 2010 was affected by Typhoon Megi as it was held under the rain. The relay from November 6–8 acted as a demonstration relay.', 'title': '2010 Asian Games torch relay'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ray Lui Leung-wai (born 22 December 1956) is a Vietnam-born Hong Kong actor, with family roots in Lianjiang, Zhanjiang, Guangdong. He is best known for his role as "Ting Lik" in the 1980 Hong Kong television series "The Bund" produced by TVB, which propelled him to fame. Since then, Lui has acted in several films and other television series also produced by TVB.', 'title': 'Ray Lui'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Lianjiang (postal: Limkong; ) is a county-level city in the municipal region of Zhanjiang, Guangdong.', 'title': 'Lianjiang, Guangdong'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Litang–Zhanjiang Railway or Lizhan Railway (), is a railroad in southern China from Litang Township in the Guangxi Autonomous Region on the Hunan–Guangxi Railway, to the port city of Zhanjiang, in Guangdong Province, on the South China Sea. The line has a total length of 318.2 km and was built from 1954 to 1955. Major cities and towns along route include Guigang, Xingye County, Yulin (Guangxi), Luchuan, Lianjiang (Guangdong), Suixi (Guangdong) and Zhanjiang.', 'title': 'Litang–Zhanjiang Railway'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Belmont Bay is a body of water at the mouth of the Occoquan River between Fairfax and Prince William counties, Virginia. The bay covers about 1500 acre . The bay adjoins the Elizabeth Hartwell Mason Neck National Wildlife Refuge and Mason Neck State Park on the Fairfax County side and the Occoquan Bay National Wildlife Refuge in Prince William County. The bay was named for the home, "Belmont," which was built circa 1730 overlooking the bay by Catesby Cocke, who was the clerk of the Prince William County court. Belmont Bay is notable for sightings of bald eagles that nest and feed in the refuges and for the numerous Great Blue Herons. Belmont Bay is also a popular destination for pleasure boats. Summer weekends usually attract 40 to as many as 100 boats to this location.', 'title': 'Belmont Bay'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Forest Park Senior High School is a public high school in Montclair, Virginia, unincorporated Prince William County, Virginia, United States. It is part of Prince William County Public Schools and is located on 15721 Forest Park Drive (formerly Spriggs Road; the name changed during 2005-2006 construction on Spriggs Road). The school's name references adjacent Prince William Forest Park, one of the largest national parks in the Washington metropolitan area.", 'title': 'Forest Park High School (Montclair, Virginia)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Leven Powell was born to William Powell and Eleanor (Peyton). Leven was born near Manassas in Prince William County, Virginia. He studied in private schools. He was deputy sheriff of Prince William County, Virginia, before he moved to Loudoun County in 1763, where he engaged in mercantile pursuits. He purchased a mill on Hunger Run and named it Sally Mill after his young wife, Sally. Sally Mill Road is between Aldie, Virginia and Middleburg, Virginia. A wall of the original mill still exists on the site. Leven later purchased 50 acres from Joseph Chinn who had built Chinn's Ordinary, now called the Red Fox Inn, in 1728 near the center of that 50 acre parcel. The area had been called Chinn's Crossroads, and was then known as Powell Town. When the town was officially established in 1787, Leven Powell declined to have the town named after him, so the name became Middleburgh, and later simply Middleburg.", 'title': 'Leven Powell'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Prince William County, Virginia is divided into seven magisterial districts: Brentsville, Coles, Gainesville, Neabsco, Occoquan, Potomac, and Woodbridge. The magisterial districts each elect one supervisor to the Board of Supervisors which governs Prince William County. There is also a Chairman elected by the county at-large, bringing total Board membership to 8. A Vice-Chairman and a Chairman Pro-Tem are selected by the Board from amongst its membership. The current Chairman is Corey A. Stewart, who previously served as the Occoquan District Supervisor. The current Vice-Chairman is Supervisor Peter Candland, the Gainesville District Supervisor.', 'title': 'Prince William Board of County Supervisors'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Prince William County Courthouse is a historic courthouse located at Manassas, Prince William County, Virginia. It was built in 1892-1893, and is a two-story, Romanesque style polychromatic brick building. It measures 52 feet by 60 feet and has a hipped roof. The front facade is symmetrical and features a projecting central bay forming a three-story clock tower topped with a cupola. The building was restored in 2000-2001. The county government moved to the building from the Brentsville Courthouse and Jail, and the building continued to be actively used as a county courthouse until 1984.', 'title': 'Prince William County Courthouse'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Brentsville District High School is a public high school in Nokesville in unincorporated Prince William County, Virginia, United States, and part of Prince William County Public Schools. It is the only high school in Prince William County considered to be in a developing rural community.', 'title': 'Brentsville District High School'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Bull Run is a 32.8 mi tributary of the Occoquan River that originates from a spring in the Bull Run Mountains in Loudoun County, Virginia, and flows south to the Occoquan River. Bull Run serves as the boundary between Loudoun County and Prince William County, and between Fairfax County and Prince William County.', 'title': 'Bull Run (Occoquan River)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Prince William County, Virginia Sheriff's Office was established in 1731 to provide law enforcement and jailers for the County. In 1970, the Board of County Supervisors established the Prince William County Police Department which assumed the primary responsibility for law enforcement. In 1982, the Prince William County Adult Detention Center opened and assumed the duties of jailers. The Sheriff is a constitutional office elected by the Prince William County, City of Manassas and City of Manassas Park to provide certain public safety services.", 'title': "Prince William County Sheriff's Office"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Occoquan River is a tributary of the Potomac River in Northern Virginia, where it serves as part of the boundary between Fairfax and Prince William counties. The river is 24.7 mi long, and its watershed covers about 590 sqmi . It is formed by the confluence of Broad Run and Cedar Run in Prince William County; Bull Run, which forms Prince William County\'s boundary with Loudoun and the northerly part of Fairfax counties, enters it east-southeast of Manassas, as the Occoquan turns to the southeast. It reaches the Potomac at Belmont Bay. The Occoquan River is part of the Chesapeake Bay watershed. The name "Occoquan" is derived from a Doeg Algonquian word translated as "at the end of the water".', 'title': 'Occoquan River'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Corey Stewart (born August 1, 1968) is an American lawyer and politician from Minnesota currently serving his fourth term as At-Large Chairman of the Board of Supervisors of Prince William County, Virginia.', 'title': 'Corey Stewart (politician)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Hellyeah is an American heavy metal supergroup, consisting of Mudvayne vocalist Chad Gray, former Nothingface guitarist Tom Maxwell, bass player Kyle Sanders, guitarist Christian Brady and former Pantera and Damageplan drummer Vinnie Paul. The idea to form a supergroup originated in 2000 on the Tattoo the Earth tour, although plans were constantly put on hold due to scheduling conflicts. The summer of 2006 allowed the band to take the project seriously and record its first album. Recorded at Chasin\' Jason studio in Dimebag Darrell\'s backyard, a self-titled album was completed in roughly one month. Released on April 10, 2007, the album entered the "Billboard" 200 at number 9, selling 45,000 copies. AllMusic reviewer William Ruhlmann stated the album is "a competent example of its genre" awarding the album three and a half stars.', 'title': 'Hellyeah'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Audiotopsy are an American alternative metal supergroup, consisting of Skrape lead vocalist Billy Keeton, former Mudvayne/Hellyeah guitarist Greg Tribbett, bass player Perry Stern, and former Mudvayne drummer Matthew McDonough.', 'title': 'Audiotopsy (band)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Chad Gray (born October 16, 1971), is the lead vocalist for the groove metal supergroup Hellyeah and former lead vocalist for American heavy metal band Mudvayne.', 'title': 'Chad Gray'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Hellyeah is the debut album by the heavy metal band Hellyeah, featuring various members of Pantera, Mudvayne, Damageplan and Nothingface.', 'title': 'Hellyeah (album)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Greg Tribbett (born November 7, 1968) is the guitarist and backing vocalist for American band Mudvayne, and the former guitarist for Hellyeah. He has been with Mudvayne since their inception in 1996. He has named Randy Rhoads as the guitarist who most influenced him. He plays Gibson Flying Vs, Gibson Les Pauls, Ibanez S-series, Ibanez Artists ARX300, Washburn Vs, and Legator Vs, which he currently endorses. Legator now makes a signature guitar for Tribbett. Tribbett is also the older brother of Derrick "Tripp" Tribbett, who previously played bass for Dope, and sang for Makeshift Romeo and Twisted Method.', 'title': 'Greg Tribbett'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Mudvayne was an American heavy metal band from Peoria, Illinois formed in 1996. They are known for their sonic experimentation, innovative album art, face and body paint, masks and uniforms. The band has sold over six million records worldwide, including nearly three million in the United States.', 'title': 'Mudvayne'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Dame Elizabeth Rosemond Taylor, DBE (February 27, 1932\xa0– March 23, 2011) was a British-American actress, businesswoman, and humanitarian. She began her career as a child actress in the early 1940s, and was one of the most popular stars of classical Hollywood cinema in the 1950s. She continued her career successfully into the 1960s, and remained a well known public figure for the rest of her life. In 1999, the American Film Institute named her the seventh-greatest female screen legend.', 'title': 'Elizabeth Taylor'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Cabine C (] , Portuguese for "Cabin C") was a short-lived Brazilian post-punk band from São Paulo. With their sonority inspired by acts such as Siouxsie and the Banshees, The Cure, Cocteau Twins and Talking Heads, and vocalist Ciro Pessoa\'s lyrics influenced by Romantic and Symbolist poets such as Edgar Allan Poe, Charles Baudelaire and Arthur Rimbaud, and by playwright Antonin Artaud, they are considered to be one of the first and most famous Brazilian gothic rock bands (even though Pessoa publicly rejected any associations with the goth subculture at the time), as well as forerunners of the cold wave movement in Brazil.', 'title': 'Cabine C'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'My Life and Times with Antonin Artaud (French: "En compagnie d\'Antonin Artaud" ) is a 1993 French film, directed by Gérard Mordillat. It is based on Jacques Prevel\'s 1974 novel of the same name. It follows Prevel\'s journal of a two-year friendship with Antonin Artaud until his death in 1948', 'title': 'My Life and Times with Antonin Artaud'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Theatre of Cruelty (French: "Théâtre de la Cruauté" ) is a form of theatre developed by avant-garde playwright, actor, essayist, and theorist, Antonin Artaud, in "The Theatre and its Double". Originally a member of the surrealist movement, Artaud eventually began to develop his own theatrical theories. The Theatre of Cruelty can be seen as break with traditional Western theatre, and a means by which artists assault the senses of the audience, and allow them to feel the unexpressed emotions of the subconscious. While Artaud was only able to produce one play in his lifetime that reflected the tenets of the Theatre of Cruelty, the works of many theatre artists reflect his theories. These artists include Jean Genet, Jerzy Grotowski, and Peter Brook.', 'title': 'Theatre of Cruelty'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Sami Frey (born Samuel Frei on 13 October 1937) is a French actor of Polish Jewish descent. Among the films he starred in are "En compagnie d\'Antonin Artaud" (1993), in which he portrays French poet and playwright Antonin Artaud, and "Bande à part" (1964) by Jean-Luc Godard.', 'title': 'Sami Frey'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The prix Antonin Artaud was a French literary prize created by Jean Digot and a few poets on 24 May 1951 in Rodez, in memory of Antonin Artaud, and was awarded for the last time in 2008.', 'title': 'Prix Antonin-Artaud'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Antoine Marie Joseph Artaud, better known as Antonin Artaud (] ; 4 September 1896 – 4 March 1948), was a French dramatist, poet, essayist, actor, and theatre director, widely recognized as one of the major figures of twentieth-century theatre and the European avant-garde.', 'title': 'Antonin Artaud'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Music and Its Double is an album composed by John Zorn and featuring three contemporary compositions which were recorded in New York City in 2011 and Finland in 2012 and released on the Tzadik label in October 2012. The first track dedicated to composer György Ligeti, "À Rebours", was recorded at the Miller Theatre by cellist Fred Sherry and ensemble conducted by Brad Lubman. The four movements of "Ceremonial Magic" are 2011 studio recordings by David Fulmer and Kenny Wollesen and the final composition, "La Machine De L\'Être" inspired by Antonin Artaud, was recorded by the Lahti Symphony Orchestra in 2012.', 'title': 'Music and Its Double'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Bureau of Surrealist Research, also known as the "Centrale Surréaliste" or "Bureau of Surrealist Enquiries" was a Paris-based office in which a loosely affiliated group of Surrealist writers and artists gathered to meet, hold discussions, and conduct interviews in order to "gather all the information possible related to forms that might express the unconscious activity of the mind." Located at 15 Rue de Grenelle, it opened on October 11, 1924 under the direction of Antonin Artaud, just four days before the publication of the first "Surrealist Manifesto" by André Breton.', 'title': 'Bureau of Surrealist Research'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Jet of Blood (Jet de Sang), also known as Spurt of Blood, is an extremely short play by the French theatre practitioner, Antonin Artaud, who was also the founder of the "Theatre of Cruelty" movement. "Jet of Blood" was completed in Paris, on January 17, 1925, perhaps in its entirety on that day alone. The original title was "Jet de Sang ou la Boule de Verre", but the second half of the title was dropped prior to the first publication and production of the work.', 'title': 'Jet of Blood'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Well of the World\'s End is an Anglo-Scottish Border fairy tale, recorded in the Scottish Lowlands, collected by Joseph Jacobs in "English Fairy Tales". His source was "The Complaynt of Scotland",and he notes the tale\'s similarity to the German "Frog Prince". Like that tale, it is Aarne-Thompson type 440, "The Frog King" or "Iron Henry".', 'title': "The Well of the World's End"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "None Shall Escape is a 1944 war film. Even though the film was made during the Second World War, the setting is a post-war Nuremberg-style war crimes trial. Alexander Knox plays Wilhelm Grimm, a Nazi officer who is on trial, and the story unfolds through the eyes of several witnesses, including a Catholic priest, Father Warecki (Henry Travers), Grimm's brother Karl (Erik Rolf) and Marja Pacierkowski (Marsha Hunt), a woman to whom he was once engaged.", 'title': 'None Shall Escape'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Castle Waiting is an Eisner Award winning graphic novel series created by Linda Medley. It is in a world of fairy tales and mythology featuring a mix of old-fashioned storytelling and more ironic, modern touches. The series brings together characters from several classic fairy tales, such as Simple Simon and Iron Henry, as well as referencing several others such as Jack and the Beanstalk and Sleeping Beauty. The story focuses predominantly on the daily lives of the characters and their interactions with one another, as well as their complicated pasts.', 'title': 'Castle Waiting'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Jamieson Kent Price is an American voice actor, best known for his deep and booming voice for numerous anime and video games. He is known as the voice of Walter Bernhard in "," Largo the Black Lion in "Tales of the Abyss", Iron Tager from the "BlazBlue" series, the Count of Monte Cristo in "Gankutsuou", Ovan in ". hack//G.U.", and Galbalan, the main villain of "" and Milton Grimm from "Ever After High". Price also had a part in the 2000 movie "The Patriot".', 'title': 'Jamieson Price'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Parkway Man also known as Iron Henry is a statue located on the outskirts of Bowden Housteads Woods in the Handsworth district of Sheffield, England. The statue is visible from the road, and can be seen by people driving on Sheffield Parkway. The statue can also be viewed using public footpaths in the woods.', 'title': 'Parkway Man'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Brown Bag Films, or Brown Bag, is an Irish-Canadian television animation production studio, based in Dublin, Ireland with a 2D facility based in Manchester, UK. Best known for its character CGI-animated television series\' and short films, including the Oscar nominated "Give Up Yer Aul Sins" and "Granny O\'Grimm\'s Sleeping Beauty". Brown Bag Films was established in 1994 by Cathal Gaffney and Darragh O\'Connell and the studio has garnered a number of awards, including Academy Award nominations for "Give Up Yer Aul Sins" (Best Animated Short Film 2001) and "Granny O\'Grimm\'s Sleeping Beauty" (Best Animated Short Film 2010), six Emmy Award wins for "Peter Rabbit", an Emmy award for "Bing" and a number of BAFTA, Emmy and Annie nominations for their shows "Octonauts", "Doc McStuffins" and "Henry Hugglemonster".', 'title': 'Brown Bag Films'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The Princess and the Frog is a 2009 American animated musical film produced by Walt Disney Animation Studios and released by Walt Disney Pictures. The 49th Disney animated feature film, the film is loosely based on the novel "The Frog Princess" by E. D. Baker, which is in turn based on the Brothers Grimm fairy tale "The Frog Prince". Written and directed by Ron Clements and John Musker, the film features an ensemble voice cast that stars Anika Noni Rose, Bruno Campos, Keith David, Michael-Leon Wooley, Jennifer Cody, and Jim Cummings, with Peter Bartlett, Jenifer Lewis, Oprah Winfrey, Terrence Howard, and John Goodman. Set in 1920s New Orleans, the film tells the story of a hardworking waitress named Tiana who dreams of owning her own restaurant. After kissing a prince who has been turned into a frog by an evil voodoo sorcerer, Tiana becomes a frog herself and must find a way to turn back into a human before it is too late.', 'title': 'The Princess and the Frog'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Count Henry II of Holstein-Rendsburg (nickname "Iron Henry"; \u20091317 – \u20091384 ) was count of Holstein-Rendsburg and pledge lord of Southern Schleswig. He ruled jointly with his younger brother, Count Nicholas (d. 1397).', 'title': 'Henry II, Count of Holstein-Rendsburg'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': '"The Frog Prince; or, Iron Henry" (German: "Der Froschkönig oder der eisen Heinrich" , literally "The Frog King; or, The Iron Heinrich") is a fairy tale, best known through the Brothers Grimm\'s written version; traditionally it is the first story in their collection.', 'title': 'The Frog Prince'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Henry Grissell (4 July 1817 – 31 January 1883), sometimes known as "Iron Henry", was an English foundry-man who was responsible for the ironwork in a number of prestigious buildings in England, Russia, Austria, and Egypt.', 'title': 'Henry Grissell'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Blue Hawaii is the fourteenth album by American singer and musician Elvis Presley, released on RCA Victor Records in mono and stereo, LPM/LSP 2426, on October 20, 1961. It is the soundtrack to the 1961 film of the same name starring Presley. Recording sessions took place at Radio Recorders in Hollywood on March 21, 22, and 23, 1961. In the United States, the album spent 20 weeks at the number one slot and 39 weeks in the Top 10 on "Billboard"\' s Top Pop LPs chart. It was certified Gold on December 21, 1961, Platinum and 2x Platinum on March 27, 1992 and 3x Platinum on July 30, 2002 by the Recording Industry Association of America. On the US Top Pop Albums chart "Blue Hawaii" is second only to the soundtrack of "West Side Story" as the most successful album of the 1960s.', 'title': 'Blue Hawaii (Elvis Presley album)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Blue Hawaii is a tropical cocktail made of rum, pineapple juice, Curaçao, sweet and sour mix, and sometimes vodka as well. It should not be confused with the similarly named Blue Hawaiian cocktail (also known as the Swimming Pool cocktail) that contains creme of coconut instead of sweet and sour mix.', 'title': 'Blue Hawaii (drink)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The U.S. state of Oregon has an extensive history of laws regulating the sale and consumption of alcoholic beverages, dating back to 1844. It has been an alcoholic beverage control state, with the Oregon Liquor Control Commission holding a monopoly over the sale of all distilled beverages, since Prohibition. Today, there are thriving industries producing beer, wine, and liquor in the state. Alcohol may be purchased between 7 a.m. and 2:30 a.m. As of 2007, consumption of spirits is on the rise, while beer consumption is holding steady. Also, 11% of beer sold in Oregon was brewed in-state, the highest figure in the United States.', 'title': 'Alcoholic beverages in Oregon'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Till mitt eget Blue Hawaii" is a song written by Rose-Marie Stråhle, and recorded by Vikingarna on the 1990 album "Kramgoa låtar 18". With lyrics about Hawaii, it became a major Svensktoppen hit, staying at the chart for 23 weeks during the period 7 January-13 May 1990, and held first position for the first nine weeks. In October 1989, the song won "Hänts meloditävling".', 'title': 'Till mitt eget Blue Hawaii'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Flaming beverages include cocktails and other mixed drinks that contain flammable, high-proof alcohol, which is ignited prior to consumption. The alcohol may be an integral part of the drink, or it may be floated as a thin layer across the top of the drink. The flames are mostly for dramatic flair. However, in combination with certain ingredients, the flavor of the drink is altered. Some flavors are enhanced, and it may impart a toasted flavor to some drinks.', 'title': 'Flaming beverage'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Blue on Blue is Bobby Vinton\'s sixth studio album, released in 1963. Cover versions include the jazz songs "St. Louis Blues" and "Blueberry Hill", "Am I Blue", "Blue, Blue Day", the Fleetwoods\' hit "Mr. Blue", "My Blue Heaven", three show tunes ("Blue Skies", "Blue Hawaii" and "Blue Moon"), and The Clovers Rhythm and blues hit, "Blue Velvet".', 'title': 'Blue on Blue (Bobby Vinton album)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Juice is a beverage made from the extraction or pressing out of the natural liquid contained in fruit and vegetables. It can also refer to liquids that are flavored with these or other biological food sources such as meat and seafood (e.g., clam juice). Juice is commonly consumed as a beverage or used as an ingredient or flavoring in foods or other beverages, such as smoothies. Juice emerged as a popular beverage choice after the development of pasteurization methods allowed for its preservation without using fermentation (the approach used with wine production). The Food and Agriculture Organization of the United Nations (FAO) estimated the total world production of citrus fruit juices to be 12,840,318 tonnes in 2012. The largest fruit juice consumers are New Zealand (nearly a cup, or 8 ounces, each day) and Colombia (more than three quarters of a cup each day). Fruit juice consumption on average increased with country income level. To the American food industry, fruit juice is more profitable than only fruit.', 'title': 'Juice'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Blue Sky Beverage Company is an all natural beverage company that produces a large selection of natural soft drinks and energy drinks. It is a wholly owned subsidiary of the Monster Beverage Corporation. The company was established in Santa Fe, New Mexico, in 1980 where it remained until it was purchased by Monster (then Hansen Beverage) in 2000. Coca-Cola North America took ownership of Blue Sky Sodas, Hansen’s Juice Products, Hansen’s Natural Sodas, Hubert’s Lemonade, Peace Tea and other non-energy drink brands as part of Coke’s partnership with Monster Beverage Corp on Jun 12, 2015.', 'title': 'Blue Sky Beverage Company'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The YF-77 is China's first cryogenic rocket engine developed for booster applications. It burns liquid hydrogen fuel and liquid oxygen oxidizer using a gas generator cycle. A pair of these engines will power the LM-5 core stage. Each engine can independently gimbal in two planes. Although the YF-77 is ignited prior to liftoff, the LM-5's four strap-on boosters will provide most of the initial thrust in an arrangement similar to the European Vulcain on the Ariane 5 or the Japanese LE-7 on the H-II. Like the Vulcain, the YF-77 uses the less efficient gas generator cycle and even for that application it has less performance than the European engine.", 'title': 'YF-77'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The legal drinking age in India and the laws which regulate the sale and consumption of alcohol vary significantly from state to state. In India, consumption of alcohol is prohibited in the states of Gujarat, Bihar and Nagaland as well as the union territory of Lakshadweep. There is a partial ban on alcohol in some districts of Manipur. All other Indian states permit alcohol consumption but fix a legal drinking age, which ranges at different ages per region. In some states, the legal drinking age can be different for different types of alcoholic beverage.', 'title': 'Alcohol laws of India'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Carol Sloane (born March 5, 1937) is an American jazz singer born in Providence, Rhode Island, who has been singing professionally since she was 14, although for a time in the 1970s she worked as a legal secretary in Raleigh, North Carolina. In addition, between September 1967 and May 1968, she occasionally wrote album reviews for "Down Beat". She currently lives in Stoneham, Massachusetts.', 'title': 'Carol Sloane'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Douglas D. Scott is an American archaeologist most notable for his work at the Little Bighorn in the mid-1980s. Working with Richard Fox, Melissa Connor, Doug Harmon, and staff and volunteers from the National Park Service, Scott worked to sketch out a field methodology that has enabled archaeologists to systematically investigate battlefields. This work is internationally recognized as constituting a great step forward in our ability to interpret battlefields archaeologically, regardless of the extent of the historical record. At the Little Bighorn, the fieldwork produced an interpretation of the battle that for the first time gave a clear understanding of the way the battle developed and pointed out some of the glaring inaccuracies of the historiography of the event. The fieldwork also helped determine which of the 242 headstones to the 210 U.S. soldiers lost at the Little Bighorn were erroneous, and recovered skeletal elements allowed one of the soldiers to be positively identified. It was not as successful in recovering the remains of 24 men lost in Deep Ravine and whose whereabouts are unknown to this day.', 'title': 'Douglas D. Scott'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Sylvester Antolak (September 10, 1916 St. Clairsville, Ohio – May 24, 1944 Cisterna di Littoria, Italy) was a United States Army Sergeant who posthumously received the Medal of Honor for actions on May 24, 1944. Sergeant Antolak was an American of Polish descent. He joined the army from his hometown in July 1941.', 'title': 'Sylvester Antolak'}
