 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Dinmukhamed Kanatuly Kudaibergen () is a Kazakh singer born on May 24, 1994 in Aktobe, Kazakhstan. Dimash\'s parents Kanat Kudaibergenovich and Svetlana Aitbayeva are honored music artists of the Republic of Kazakhstan. Dimash is a tenor altino. He was the 2015 Grand Prix winner of the Slavianski Bazaar in Vitebsk In the same year, he was named the "Nation\'s Favorite" (kazakh. " Халықтың сүйіктісі"), participant of the international festival "ABU TV song" in Istanbul, Turkey, and awarded with the Certificate of Honor of the President of the Republic of Kazakhstan for an important contribution into strengthening the unity of the people in Kazakhstan. He placed second in "Singer 2017".', 'title': 'Dimash Kudaibergen'}
