 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Bob Dylan ( ; born Robert Allen Zimmerman, May 24, 1941) is an American singer, songwriter, musician, painter, and writer. He has been influential in popular music and culture for more than five decades. Much of his most celebrated work dates from the 1960s, when he became a reluctant "voice of a generation" with songs such as "Blowin\' in the Wind" and "The Times They Are a-Changin\'", which became anthems for the Civil Rights Movement and anti-war movement. Leaving behind his initial base in the American folk music revival, his six-minute single "Like a Rolling Stone", recorded in 1965, enlarged the range of popular music.', 'title': 'Bob Dylan'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"The Tinker" is a short story by Orson Scott Card. It appears in his short story collection "The Worthing Saga". Card first published "The Tinker" in the Vol. 1, No. 2 (1980) issue of "Eternity SF" magazine.', 'title': 'The Tinker'}
