 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Unaccompanied Sonata" is a short story by American writer Orson Scott Card, first published in the March, 1979 issue of "Omni" magazine. It appears in his short story collections "Unaccompanied Sonata and Other Stories" and "Maps in a Mirror". It was nominated in 1979 for the Nebula Award for Best Short Story and in 1980 for the Hugo Award for Best Short Story.', 'title': 'Unaccompanied Sonata'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Breaking the Game" is a short story by American writer Orson Scott Card. It appears in his short story collections "Capitol" and "The Worthing Saga". Card first published it in the January 1979 issue of "Analog Science Fiction and Fact".', 'title': 'Breaking the Game'}
