 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Gert Fram" is the first short story that was published by American author Orson Scott Card. It appears in his short story collection "Maps in a Mirror", but it originally appeared in the July 1977 fine arts issue of "Ensign" magazine under the pen name Byron Walley. It is Card\'s first published work.', 'title': 'Gert Fram'}
