 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Analog Science Fiction and Fact is an American science-fiction magazine published under various titles since 1930. Originally titled Astounding "Stories of Super-Science", the first issue was dated January 1930, published by William Clayton, and edited by Harry Bates. Clayton went bankrupt in 1933 and the magazine was sold to Street & Smith. The new editor was F. Orlin Tremaine, who soon made "Astounding" the leading magazine in the nascent pulp science fiction field, publishing well-regarded stories such as Jack Williamson\'s "Legion of Space" and John W. Campbell\'s "Twilight". At the end of 1937, Campbell took over editorial duties under Tremaine\'s supervision, and the following year Tremaine was let go, giving Campbell more independence. Over the next few years Campbell published many stories that became classics in the field, including Isaac Asimov\'s "Foundation" series, A.E. van Vogt\'s "Slan", and several novels and stories by Robert A. Heinlein. The period beginning with Campbell\'s editorship is often referred to as the Golden Age of Science Fiction.', 'title': 'Analog Science Fiction and Fact'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'There are various sources for short stories set in the Ender\'s Game series. One is the short story collection "First Meetings" by Orson Scott Card. This collection contains the original novelette "Ender\'s Game" plus three other stories. Another source is Card’s webzine "InterGalactic Medicine Show". The first four stories from Card\'s webzine: "Mazer in Prison," "Pretty Boy," "Cheater," and "A Young Man with Prospects," also appear in the paperback anthology "Orson Scott Card\'s InterGalactic Medicine Show". Reprints of short stories in the Ender\'s Game series can be found in other science fiction anthologies.', 'title': "List of Ender's Game series short stories"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Religion in Iceland was initially the Norse paganism that was a common belief among mediaeval Scandinavians who started settling Iceland in the 9th century AD, until Christian conversion around 1000 AD, though paganism did not vanish then. Starting in the 1530s, Iceland, originally  Catholic and under the Danish crown, formally became Lutheran under the Icelandic Reformation, which culminated in 1550. As such, Iceland has a state Church, the Evangelical Lutheran Church of Iceland, and religious freedom has been a legal right since 1874. The state church is supported by the government, but all registered religions received support from a church tax paid by taxpayers over the age of 16 years.', 'title': 'Religion in Iceland'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Møllevang Church (Danish: "Møllevangskirken" ) is a church in Aarhus, Denmark. The church is situated in the Fuglebakken neighborhood on the street Fuglesangs Alle, north of Ring 1, in Western Aarhus. Møllevang Church is a part of the Church of Denmark, the Danish state church, and is the parish church of Møllevang Parish. The church serves some 9000 parishioners and holds weekly sermons as well as weddings, burials and baptisms.', 'title': 'Møllevang Church'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'This list of bishops, seniors, and superintendents of Hamburg records the spiritual heads of the Lutheran church in Hamburg. Originally the Lutheran church in Hamburg formed a state church established by Johannes Bugenhagen\'s church order on 15 May 1529, after most of Hamburg\'s burghers had adopted Lutheranism before. As state church it was governed in administrative matters by the Senate of Hamburg (city government) and the , according to the law named the Long Recess of 1529. At first the church order provided for superintendents as spiritual leaders. Since 1593 the spiritual leadership was wielded by a collegial body, the Spiritual Ministerium, with a senior elected by its members, the ministers (pastors) of the parishes. Separation of Church and State started in 1860, with the last privileges of state patronage waived in 1919. The new church order of 1923 enfranchised the synodals to elect one of the five "Hauptpastoren" (i.e. principal or head pastors) at the quintet of (principal or head churches) as senior.', 'title': 'List of bishops of Hamburg'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The Church of All Saints is a Church of England parish church in Doddinghurst, Essex. The church is a Grade I listed building.', 'title': 'Church of All Saints, Doddinghurst'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Wooddale Church is a large multi-campus evangelical Christian church located in Eden Prairie, Minnesota and Edina, Minnesota. The success of Wooddale Church led to the formation of many other similar churches in Minnesota. Today, Wooddale Church is affiliated with the Converge formerly the Baptist General Conference as well as the Conservative Congregational Christian Conference.', 'title': 'Wooddale Church'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Sarah Melissa Granger Kimball (December 29, 1818 – December 1, 1898) was a 19th-century Mormon advocate for women's rights and early leader in the Relief Society of The Church of Jesus Christ of Latter-day Saints (LDS Church). Kimball's involvement in the Church led to the establishment of the women's Relief Society as well as participation in the national suffrage movement.", 'title': 'Sarah Granger Kimball'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Lyseng Church (Danish: "Lyseng Kirke" ) is a church in Aarhus, Denmark. The church is situated in the Højbjerg neighborhood in on Bushøjvej by Ring 2 in the southern suburbs of Aarhus. Lyseng Church is a part of the Church of Denmark, the Danish state church, and is a shared secondary church to Holme Parish and Skåde Parish, officially under Holme pastorate along with Holme Church.', 'title': 'Lyseng Church'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'St. Lukas Church (Danish: "Skt. Lukas Kirke" ) is a church in Aarhus, Denmark. The church is situated in the Frederiksbjerg neighbourhood on Skt. Lucas Kirkeplads by Ingerslevs Boulevard. St. Lukas Church is a parish church under the Church of Denmark, the Danish state church, under the Diocese of Aarhus. It is the parish church of St. Lukas Parish which has some 11.000 parish members. The church was designed by architects Anton Frederiksen and Kaj Gottlob in neoclassical style with a 35 meters tall tower. It was constructed between 1921 and 1926 but the crypt under the church, with room for 200 graves, was opened before the church itself, in 1923.', 'title': "St. Luke's Church, Aarhus"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Catholic resistance to Nazism was a component of German resistance to Nazism and of Resistance during World War II. The Church in Germany opposed the rise of Nazism, but attempted compromise when Hitler won power. From the outset of Nazi rule in 1933, issues emerged which brought the Church into conflict with the regime and persecution of the Church led Pope Pius XI to denounce the policies of the Nazi Government in the 1937 papal encyclical "Mit brennender Sorge". His successor Pius XII faced the war years and provided intelligence to the Allies. Though Catholics fought on both sides in World War II and neither the Catholic nor Protestent churches as institutions were prepared to openly oppose the Nazi State, the churches provided the earliest and most enduring centres of systematic opposition to Nazi policies, and Christian morality and Nazi anti-Church policies motivated many German resistors and provided moral impetus for individuals in their efforts to overthrow Hitler.', 'title': 'Catholic resistance to Nazi Germany'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The Church of England (C of E) is the state church of England. The Archbishop of Canterbury (currently Justin Welby) is the most senior cleric, although the monarch is the supreme governor. The Church of England is also the mother church of the international Anglican Communion. It traces its history to the Christian church recorded as existing in the Roman province of Britain by the third century, and to the 6th-century Gregorian mission to Kent led by Augustine of Canterbury.', 'title': 'Church of England'}]

