[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The 1936 Individual Speedway World Championship was the first ever Speedway World Championship and was won by Lionel Van Praag of Australia. It was the first of a record 26 times that London's Wembley Stadium would host the World Final with the last being in 1981.", 'title': '1936 Individual Speedway World Championship'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Brian Andersen (born March 13, 1971) is a Danish international motorcycle speedway rider who rode in Speedway Grand Prix between 1997 and 2001 and 2001 Speedway World Cup. Andersen won Individual Speedway Danish Championship in 1995 and 1999. He won 1991 Individual Speedway Junior World Championship.', 'title': 'Brian Andersen'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Jack Ellis Young (31 January 1925 in Adelaide, South Australia – 28 August 1987 in Adelaide) was a Motorcycle speedway rider who won the Speedway World Championship in 1951 and 1952. He also won the London Riders' Championship 1953 and 1954 and was a nine time South Australian Champion between 1948 and 1964.", 'title': 'Jack Young (speedway rider)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The 1989 Individual Speedway World Championship was the 45th Speedway World Championship held since it was first held in 1936. It was the second time the championship was held in West Germany after previously being held in Norden in 1983.', 'title': '1989 Individual Speedway World Championship'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The 2010 Individual Speedway Polish Championship (Polish: "Indywidualne Mistrzostwa Polski, IMP" ) was the 2010 version of Individual Speedway Polish Championship organized by the Polish Motor Union (PZM). The Championship was won by Janusz Kołodziej, who beat Krzysztof Kasprzak in the Run-off. Third was Rafał Dobrucki. Kołodziej, who won 2009 (host in 2010), 2010 Golden Helmet and 2010 Speedway World Cup was award nomination to the 2011 Speedway Grand Prix. The defending Champion, Tomasz Gollob, who was a 2010 Speedway Grand Prix leader, resigned from the IMP Final.', 'title': '2010 Individual Speedway Polish Championship'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Australian rider Jack Young became the first ever dual winner (and the first to win two in a row) when he won his second straight World Championship after scoring 14 points. Second was Welshman Freddie Williams on 13 points, with Britain's Bob Oakley third on 12 points.", 'title': '1952 Individual Speedway World Championship'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The 2010 Individual Speedway World Championship Grand Prix Qualification were a series of motorcycle speedway meetings used to determine the three riders who qualified for the 2010 Speedway Grand Prix. The top eight riders finishing the 2009 Grand Prix series automatically qualified for 2010. The final round of qualification – the Grand Prix Challenge – took place on 18 September 2009, in Coventry, England. The Grand Prix Challenge was won by Magnus Zetterström who finished ahead of Chris Holder and former Grand Prix rider Jarosław Hampel. All three riders qualified for the 2010 Grand Prix.', 'title': '2010 Speedway Grand Prix Qualification'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The British Speedway Championship. is an annual motorcycle speedway competition open to British national speedway riders. The winner of the event becomes the British Speedway Champion. It has been open in the past to riders from British dominions and was dominated in its early years by riders from New Zealand such as Barry Briggs and Ivan Mauger this was due to the fact that the British Final formed part of the World Individual Speedway championship qualifying rounds. From 1975 onwards Australia and New Zealand held their own World Individual Speedway championship qualifying rounds. In the first dozen finals, it was only won twice by a British born rider, both times by Peter Craven.', 'title': 'British Speedway Championship'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'There are annual world championship events in the sport of motorcycle speedway for individual riders - the Speedway Grand Prix - and for national teams - the Speedway World Cup. Each has a counterpart for riders under 21: the Speedway World Under 21 Championship and the Team Speedway Junior World Championship. A pairs event, the Speedway World Pairs Championship, ran until 1993.', 'title': 'Speedway World Championship Competitions'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Kurt Hansen is a speedway rider. He was in 1984 Individual Speedway Junior European Championship, 1985 Individual Speedway Junior European Championship and 1993 Individual Speedway World Championship.', 'title': 'Kurt Hansen (speedway rider)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Cormac Fitzgeoffrey is a fictional character created by Robert E. Howard. He is a half-Norman, half-Gael taking part in the Third Crusade. Howard wrote two short stories featuring the character and a synopsis that was later completed by another author. Although Howard was most famous for his fantasy fiction, especially Conan the Barbarian, the Cormac stories have a purely historical setting, albeit one with a heroic theme.', 'title': 'Cormac Fitzgeoffrey'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'A list of poems by Robert E. Howard (1906–1936), an American writer and poet in early 20th century Texas. His love of poetry came from being read to by his mother at a young age. However, his attempts to make a living by poetry were unsuccessful and he is today most remembered for his short stories and fiction. Nevertheless, Howard wrote hundreds of poems; many were published within his lifetime and the others published after his 1936 suicide.', 'title': 'Robert E. Howard bibliography (poems P–Z)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Nameless Cults: The Cthulhu Mythos Fiction of Robert E. Howard is a collection of Cthulhu Mythos short stories by Robert E. Howard. It was first published in the US in 2001 by Chaosium Press. All of these stories had been published previously, between 1929 and 1985, in "Weird Tales", "From Beyond the Dark Gateway", "Strange Tales", "Weirdbook", "Fantasy Crosswinds", "Coven", "Fantasy Book", "Dark Things", and "The Fantasy Magazine".', 'title': 'Nameless Cults (short story collection)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Harlan Perry Howard (September 8, 1927 – March 3, 2002) was an American songwriter, principally in country music. In a career spanning six decades, Howard wrote a large number of popular and enduring songs, recorded by a variety of different artists. Howard was married to country singer Jan Howard. He was inducted into the Nashville Songwriters Hall of Fame in 1973, and the Country Music Hall of Fame in 1997.', 'title': 'Harlan Howard'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Pulp magazines or Pulp Fiction (often referred to as "the pulps") were inexpensive fiction magazines that were published from 1896 to the 1950s. The term "pulp" derives from the cheap wood pulp paper on which the magazines were printed. In contrast, magazines printed on higher quality paper were called "glossies" or "slicks". The typical pulp magazine had 128 pages; it was 7 in wide by 10 in high, and 0.5 inch thick, with ragged, untrimmed edges.', 'title': 'Pulp magazine'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Vargo Statten Science Fiction Magazine (later Vargo Statten British Science Fiction Magazine, The British Science Fiction Magazine and The British Space Fiction Magazine) was a British science fiction magazine which published nineteen issues between 1954 and 1956. It was initially published by Scion Press, with control passing to a successor company, Scion Distributors, after Scion went bankrupt in early 1954. At the end of 1954, as part payment for a debt, Scion Distributors handed control of the magazine to Dragon Press, who continued it for another twelve issues. E.C. Tubb and John Russell Fearn were regular contributors, and Kenneth Bulmer also published several stories in the magazine. Barrington Bayley\'s first published story, "Combat\'s End", appeared in May 1954. The editor was initially Alistair Paterson, but after seven issues Fearn took the helm: "Vargo Statten" was one of Fearn\'s aliases, and the magazine\'s title had been chosen because of his popularity. Neither Paterson nor Fearn had enough of a budget to attract good quality submissions, and a printing strike in 1956 brought an end to the magazine\'s life.', 'title': 'Vargo Statten Science Fiction Magazine'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Conan the Barbarian is a 1982 American fantasy adventure film directed and co-written by John Milius. It is based on stories by Robert E. Howard, a pulp fiction writer of the 1930s, about the adventures of the eponymous character in a fictional pre-historic world of dark magic and savagery. The film stars Arnold Schwarzenegger and James Earl Jones, and tells the story of a young barbarian (Schwarzenegger) who seeks vengeance for the death of his parents at the hands of Thulsa Doom (Jones), the leader of a snake cult. Buzz Feitshans and Raffaella De Laurentiis produced the film for her father Dino De Laurentiis, with Edward R. Pressman as an executive producer. Basil Poledouris composed the music.', 'title': 'Conan the Barbarian (1982 film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'A fantasy fiction magazine or fantasy magazine is a magazine which publishes primarily fantasy fiction. Not generally included in the category are magazines for children with stories about such characters as Santa Claus. Also not included are adult magazines about sexual fantasy. Many fantasy magazines, in addition to fiction, have other features such as art, cartoons, reviews, or letters from readers. Some fantasy magazines also publish science fiction and horror fiction, so that here is not always a clear distinction between a fantasy magazine and a science fiction magazine. For example, "Fantastic" magazine published almost exclusively science fiction for much of its run.', 'title': 'Fantasy fiction magazine'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The 1951 Asian Games, officially known as the First Asian Games, was a multi-sport event celebrated in New Delhi, India from 4 to 11 March 1951. The Games received names like First Asiad and 1951 Asiad. A total of 489 athletes representing 11 Asian National Olympic Committees (NOCs) participated in 57 events from eight sports and discipline. The Games was the successor of the Far Eastern Games and the revival of the Western Asiatic Games. The 1951 Asiad were originally scheduled to be held in 1950, but postponed until 1951 due to delays in preparations. On 13 February 1949, the Asian Games Federation was formally established in Delhi, with Delhi unanimously announced as the first host city of the Asian Games. <br> The games were managed by a strong Organising Committee (see Organisation below). <br> Countries invited included almost all the independent Asian countries of the time except Soviet Union and Vietnam, due to the political structure of those nations.', 'title': '1951 Asian Games'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'A multi-sport event is an organized sporting event, often held over multiple days, featuring competition in many different sports between organized teams of athletes from (mostly) nation-states. Events are typically held over a few days to accommodate the large number of events held, often more than those in single-sport competitions. The first major, modern, multi-sport event of international significance was the modern Olympic Games. Some of the most recognised sporting events in the world today are multi-sport events — the World Games, the Commonwealth Games, the Pan American Games and the Mediterranean Games — among others. This article lists all major multi-sport events, whether defunct or functioning, in the modern day. A full listing of all major multi-sport events is provided in the table below.', 'title': 'List of multi-sport events'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Asian Games, also known as Asiad, is a Pancontinental multi-sport event held every four years among athletes from all over Asia. The Games were regulated by the Asian Games Federation (AGF) from the first Games in New Delhi, India, until the 1978 Games. Since the 1982 Games they have been organized by the Olympic Council of Asia (OCA), after the breakup of the Asian Games Federation. The Games are recognized by the International Olympic Committee (IOC) and are described as the second largest multi-sport event after the Olympic Games.', 'title': 'Asian Games'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Asian Youth Games, also known as AYG,is a multi-sport event held every four years among athletes from all over Asia. The Games have been organized by the Olympic Council of Asia (OCA). The Games are described as the second largest multi-sport event after the Asian Games.', 'title': 'Asian Youth Games'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The 2002 Asian Games (officially known as the 14th Asian Games) was a multi-sport event held in Busan, South Korea from September 29 to October 14, 2002. Busan was the second South Korean city to host the Games, after Seoul in 1986. A total of 6,572 athletes—4,605 men and 1,967 women—from 44 Asian National Olympic Committees (NOCs) participated in 38 sports divided into 419 events. The number of competing athletes was higher than the 1998 Asian Games, in which 6,544 athletes from 41 NOCs participated. It was the first time in the history of the Asian Games that all 44 member nations of the Olympic Council of Asia (OCA) participated in the Games. Afghanistan returned after the fall of the Taliban government in the midst of ongoing war; East Timor, newest member of the OCA made its debut; and North Korea competed for the first time in an international sporting event hosted by South Korea. Both nations marched together at the opening ceremony with a Korean Unification Flag depicting the Korean Peninsula as United Korea.', 'title': '2002 Asian Games medal table'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Asian Martial Arts Games, also known as AMG,is a Pancontinental multi-sport event held every four years among athletes from all over Asia, after the merger of the Asian Indoor Games and the Asian Martial Arts Games. The Games have been organized by the Olympic Council of Asia (OCA). The Games are described as the second largest multi-sport event after the Asian Games.', 'title': 'Asian Martial Arts Games'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'This is a list of sports played in the Asian Games and other major affiliated games organised by the Olympic Council of Asia. On 29 June 2009, the OCA announced major changes to the event lists in the five major events, in particular aiming to restrict each sport to be played in not more than one event, although exemptions may be made. The first round of changes commenced with the 2014 Asian Games when the number of events was recommended to be restricted to 35 with 28 Olympic sports and up to a maximum of seven non-Olympic sports. Some events currently in the Asian Games programme may henceforth be relegated to the newly formed Asian Indoor-Martial Arts Games which was first held in 2013 or to the Asian Beach Games.', 'title': 'Asian Games sports'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Asian Indoor and Martial Arts Games, also known as AIMAG, is a pancontinental multi-sport event held every four years among athletes from all over Asia, after the merger of the Asian Indoor Games and the Asian Martial Arts Games. The Games have been organized by the Olympic Council of Asia (OCA). The Games are described as the second largest Asian multi-sport event after the Asian Games.', 'title': 'Asian Indoor and Martial Arts Games'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Asian Beach Games, also known as ABG,is a multi-sport event held every four years among athletes from all over Asia. The Games have been organized by the Olympic Council of Asia (OCA). The Games are described as the second largest multi-sport event after the Asian Games and the popularity is increasing well, due to low cost of temporary venues, and sand & sea are already available in its place, while the spectators/tourists are also already available in sand & sea tourist areas. Which the first Asian Beach Games has been held in Bali Island.', 'title': 'Asian Beach Games'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Laos The 2010 Asian Games, also known as the XVI Asiad, was a multi-sport event celebrated in Guangzhou, China from November 12 to 27, 2010. Guangzhou was the second Chinese city to host the Games, after Beijing in 1990. A total of 9,704 athletes from 45 National Olympic Committees (NOCs) competed in 476 events from 42 sports and disciplines (28 Olympic sports and 14 non-Olympic sports), making it the largest event in the history of the Games. It was also the last edition of the Games to have featured such a large amount of events, as the Olympic Council of Asia (OCA) have enforced new hosting rules for future Games, beginning with the 2014 Games, scheduled to take place in Incheon, South Korea with 36 sports and disciplines set to feature.', 'title': 'Laos at the 2010 Asian Beach Games'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Cleveland School of the Arts is a public high school located in the St.Clair neighborhood of Cleveland, Ohio. It is a magnet school and part of the Cleveland Metropolitan School District. Opened in 1981, Cleveland School of the Arts is a public high school located in the St. Clair neighborhood of Cleveland, Ohio; it is a magnet school, part of the Cleveland Metropolitan School District. Cleveland School of the Arts consists of two locations: the Lower Campus, located at 2501 East 61st Street, is for students from kindergarten through 5th grade, and the Upper Campus is for students from 6th through 12th grades.', 'title': 'Cleveland School of the Arts'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Wendell Phillips Academy High School is a public 4–year high school located in the Bronzeville neighborhood on the south side of Chicago, Illinois, United States. Phillips is part of the Chicago Public Schools district and is managed by the Academy for Urban School Leadership. It is named for the noted American abolitionist Wendell Phillips. It was the first predominantly African-American high school in Chicago. The school opened in 1904. In 2010, Phillips became a "turnaround" school in an effort to lower the school\'s one–year dropout rate of 66.8 percent. The school received the Spotlight on Technology award from the Chicago Public Schools leadership technology summit in 2013. The school\'s attendance boundary includes areas of the South Side, Chinatown, and portions of the Chicago Loop.', 'title': 'Wendell Phillips Academy High School'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Chicago Military Academy-Bronzeville is a public 4-year military high school located in the Bronzeville neighborhood located on the South Side of Chicago, Illinois, in a building known as the Eighth Regiment Armory. The Academy includes a mandatory Junior Reserve Officers' Training Corps (JROTC) instructional component in addition to a four-year college preparatory curriculum.", 'title': 'Chicago Military Academy'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'John Clemens "Jack" Ryan (born October 6, 1959) is a former investment banker and American politician who was a candidate in the 2004 U.S. Senate race in Illinois. In 2000, he retired as an active partner at Goldman Sachs to teach at Hales Franciscan High School, a private, 4-year Roman Catholic high school located in the Bronzeville neighborhood of Chicago.', 'title': 'Jack Ryan (politician)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': "Jean Baptiste Point DuSable High School was a public 4–year high school located in the Bronzeville neighborhood on the South Side of Chicago, Illinois, United States. DuSable was operated by the Chicago Public Schools district. The school was named after Chicago's first permanent non-native settler, Jean Baptiste Point Du Sable. Constructed between 1931–34, DuSable opened in February 1935. Since 2005, The school building serves as home to two smaller schools; the Bronzeville Scholastic Institute and the Daniel Hale Williams Preparatory School of Medicine. Both of the schools use the DuSable name in an athletics context. The DuSable Leadership Academy was housed at the location until it closed after the 2015–16 school year. The school building was designated a Chicago Landmark on May 1, 2013.", 'title': 'DuSable High School'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Merkel High School is a public high school located in Merkel, Texas, United States and classified as a 3A school by the UIL. It is part of the Merkel Independent School District. The high school serves approximately 330 students from areas on the Northwestern part of Taylor County. Generally students from the area come from either Merkel, Tye, or Trent. A small portion of southwestern Jones County lies within the district also. The district and the school are both named after the Baylor Merkel, the first settler in the area. In 2016, the school was rated "Met Standard" by the Texas Education Agency.', 'title': 'Merkel High School'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Jonathan Alder High School is an NCA accredited public high school located in Plain City, Ohio. It is the only high school in the Jonathan Alder Local School District. The school, as well as the district, are named after Jonathan Alder, the first white settler in Madison County.', 'title': 'Jonathan Alder High School'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Hales Franciscan High School (known simply as Hales) is a private 4-year Roman Catholic high school located in the Bronzeville neighborhood on the south side of Chicago, Illinois, United States. It is part of the Roman Catholic Archdiocese of Chicago.', 'title': 'Hales Franciscan High School'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Walton High School was a public 4–year high school located in the Kingsbridge neighborhood of the Bronx borough in New York. Originally an all-girl institution, Walton became co–educational in 1977. Walton, Bayside High School, Samuel J. Tilden High School, Abraham Lincoln High School, John Adams High School, Andrew Jackson High School, and Grover Cleveland High School were all built during the Great Depression from one set of blueprints, to save money.', 'title': 'Walton High School (Bronx)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Jean Baptiste Point du Sable (or Point de Sable, Point au Sable, Point Sable, Pointe DuSable) (before 1750 – August 28, 1818) is regarded as the first permanent resident of what became Chicago, Illinois. Little is known of his life prior to the 1770s. In 1779, he was living on the site of present-day Michigan City, Indiana, when he was arrested by the British military on suspicion of being an American sympathizer in the American Revolutionary War. In the early 1780s he worked for the British lieutenant-governor of Michilimackinac on an estate at what is now the city of St. Clair, Michigan, before moving to settle at the mouth of the Chicago River. He is first recorded living in Chicago in early 1790, having apparently become established sometime earlier. He sold his property in Chicago in 1800 and moved to St. Charles, Missouri, where he died in 1818.', 'title': 'Jean Baptiste Point du Sable'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Florida Atlantic University (also referred to as FAU or Florida Atlantic) is a public university located in Boca Raton, Florida, with five satellite campuses located in the Florida cities of Dania Beach, Davie, Fort Lauderdale, Jupiter, and in Fort Pierce at the Harbor Branch Oceanographic Institution. FAU belongs to the 12-campus State University System of Florida and serves South Florida, which has a population of more than five million people and spans more than 100\xa0miles (160\xa0km) of coastline. Florida Atlantic University is classified by the Carnegie Foundation as a research university with high research activity. The university offers more than 180 undergraduate and graduate degree programs within its 10 colleges in addition to a professional degree from the College of Medicine. Programs of study cover arts and humanities, the sciences, medicine, nursing, accounting, business, education, public administration, social work, architecture, engineering, and computer science.', 'title': 'Florida Atlantic University'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 2010 Florida Atlantic University Owls football team represented Florida Atlantic University in the 2010 NCAA Division I FBS football season. The team was coached by Howard Schnellenberger and played their home games at Lockhart Stadium in Fort Lauderdale, Florida. This was the tenth season of intercollegiate football at Florida Atlantic University and was its fifth season of competition in the Sun Belt Conference. They finished the season 4–8, 3–5 in Sun Belt play.', 'title': '2010 Florida Atlantic Owls football team'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Cleveland State University Poetry Center is a literary small press and poetry outreach organization in Cleveland, Ohio, operated under the auspices of the English Department at Cleveland State University. It publishes original works of poetry by contemporary writers, though it also publishes novella, essay collections, and occasional works of criticism or translated poetry collections. It was founded in 1962 by poet Lewis Turco at what was then Fenn College, attained its present name two years later when Fenn College was absorbed into the newly founded Cleveland State University, and began publishing books in 1971. From 2007 to 2012 its Director and Series Editor was poet and professor Michael Dumanis. From 2014, its Director and Series Editor is the poet and professor Caryl Pagel.', 'title': 'Cleveland State University Poetry Center'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Ken "Mouse" McFadden is a former basketball player. He graduated from Seward Park High School in New York. He played at Cleveland State University from 1985–1989. He helped lead Cleveland State to three postseason appearances and a trip to the Sweet Sixteen. His number 10 is one of only two numbers to have been retired by Cleveland State, the other being Franklin Edwards\'s number 14. He scored 2,256 points for the Vikings from 1985 to 1989, which is still the Cleveland State record for career points scored. He also played in the CBA and USBL. He then went to work for Cleveland State\'s athletic department before being fired for accusing associate athletic director Chris Sedlock of writing numerous papers for basketball players.', 'title': 'Ken McFadden'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "The Cleveland State Vikings women's basketball team represents Cleveland State University in women's basketball. They are a member of the Horizon League (1994–present). The Cleveland State women's basketball team was formerly in the North Star Conference (1988–1992) and Mid-Continent Conference (1992–1994). Prior to 1988 the Cleveland State women's basketball team was not affiliated with any conference.", 'title': "Cleveland State Vikings women's basketball"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Cleveland State Vikings baseball team represented Cleveland State University in the sport of baseball. The Cleveland State Vikings competed in Division I of the National Collegiate Athletics Association (NCAA) and in the Horizon League. Baseball at Cleveland State was played for a total of 69 seasons. On May 2, 2011 Clevleland State University announced that they would eliminate the baseball team. The reasons cited were budget concerns as well as the difficultly of having a baseball team in the northern United States with the season starting earlier and earlier and favoring teams in the warmer southern United States.', 'title': 'Cleveland State Vikings baseball'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Cleveland State University (also known as Cleveland State or CSU) is a public university in downtown Cleveland, Ohio, United States. It was established in 1964, and opened for classes in 1965 after acquiring the buildings, property, and students of Fenn College, a private school that had been in operation since 1923. CSU absorbed the Cleveland-Marshall College of Law in 1969. Today it is part of the University System of Ohio, has more than 120,000 alumni, and offers over 200 academic programs. Its mission is to "encourage excellence, diversity, and engaged learning by providing a contemporary and accessible education in the arts, sciences, humanities and professions, and by conducting research, scholarship, and creative activity across these branches of knowledge."', 'title': 'Cleveland State University'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Homer Eugene "Woody" Woodling (February 23, 1902 – September 14, 1984) was an athletics coach and administrator at Fenn College—now Cleveland State University. Woodling served two stints as the head men\'s basketball coach at Fenn College, from 1929 to 1941 and again from 1952 to 1953. He also coached the Cleveland State baseball, track, tennis and golf teams. Woodling served as Cleveland State\'s athletic director until 1966. He was the only athletic director that Fenn College had. He served in that position from 1929 to 1965 when Fenn College became Cleveland State. He was inducted into the Cleveland State Hall of Fame in 1975.', 'title': 'Homer E. Woodling'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Cleveland State Vikings, or Vikes, are the athletic teams of Cleveland State University. Before as Fenn College they were known as the Fenn College Foxes or Fenn Foxes. Cleveland State competes in NCAA Division I. They have been a member of the NCAA Division I since 1972. They were previously a member of the NCAA College Division, a precursor to NCAA Division II. The university is a member of the Horizon League (1994–present) and Eastern Wrestling League (1978–present). Cleveland State was formerly in the Mid-Continent Conference (1982–1994) and North Star Conference (1989–1992). Cleveland State previously fielded baseball, men's cross country as well as men and women's track and field. As Fenn College they fielded men's ice hockey and rifle. Cleveland State has a number of club sports as well.", 'title': 'Cleveland State Vikings'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'This list of Florida Atlantic University people includes graduates, non-graduate former students, and current students of Florida Atlantic University and its graduate programs. Since its opening in 1964, Florida Atlantic has awarded over 100,000 degrees to more than 95,000 alumni worldwide.', 'title': 'List of Florida Atlantic University people'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Tyge Wittrock Böcher (25 October 1909 – 15 March 1983) was a Danish botanist, evolutionary biologist, plant ecologist and phytogeographer.', 'title': 'Tyge W. Böcher'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Exequiel Ezcurra (born March 21, 1950, Buenos Aires, Argentina) is a plant ecologist and conservationist. His highly interdisciplinary work spans desert plant ecology, mangroves, island biogeography, sea birds, fisheries, oceanography, and deep sea ecosystems.', 'title': 'Exequiel Ezcurra'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Peter John Grubb (born 9 August 1935 in Ilford, London) is a British ecologist and emeritus professor of botany at Cambridge University. He took his Ph.D. at Cambridge University in 1960 supervised by G.E. Briggs. He subsequently joined the staff of Magdalene College, later becoming a full professor (retired in 2001). His early work was mentored by E.J.H. Corner and A.S. Watt, and especially influenced by the latter. He has written a very lively account on his becoming a plant ecologist.', 'title': 'Peter J. Grubb'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Michael Charles Faraday Proctor PhD (born 1929) is an English botanist and plant ecologist, lecturer, scientific author and currently Honorary Research Fellow at the University of Exeter. He retired from his post as Reader in Plant Ecology at Exeter University in 1994.', 'title': 'Michael Proctor (botanist)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Jacob Weiner (born Robert Milton Weiner; 1947 in Brooklyn, New York) is an American plant ecologist at the University of Copenhagen. Weiner has made contributions to several areas of plant ecology, including competition, allocation, allometry and application of ecological knowledge to agricultural production.', 'title': 'Jacob Weiner'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Johannes Iversen (December 12, 1904 – October 17, 1972) was a Danish palaeoecologist and plant ecologist. He was born in Sønderborg and began studies in botany at the University of Copenhagen in 1923 under professor C.H. Ostenfeld, and with considerable inspiration from prof.em. Christen Raunkiær. At first he worked with macrophyte vegetation of lakes in relation to water pH. The influence from Raunkiær is particularly evident in Iversen‘s doctoral thesis, in which he divided herbaceous plants into hydrotypes based on experiments and morphological studies: xerophytes, mesophytes, hygrophytes, telmatophytes, amphiphytes and limnophytes. In addition, halobio-types (salt tolerance) were described. He brilliantly used modern equivalents in the interpretation of pollen diagrams, e.g. his now classic studies on frost damage to ivy (Hedera) and holly (Ilex) during the severe winters of the early 1940s led to their fossil pollen being used as climate indicators. Iversen demonstrated the steppe and tundra components of the late glacial flora. Iversen conducted a practical experiment with stone axe clear-cutting and slash-and-burn agriculture in a primeval forest to study the forest regeneration.', 'title': 'Johannes Iversen'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'William L. Bray, Ph.D. University of Chicago, botanist, plant ecologist, biogeographer and Professor of Botany at Syracuse University, was the first dean of the New York State College of Forestry at Syracuse University, from 1911-12.', 'title': 'William L. Bray'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Carsten Erik Olsen (March 1, 1891 – August 19, 1974) was a Danish plant ecologist and plant physiologist, who pioneered the study of plant nutrition in soils of different pH. He was born in Copenhagen and began studies of botany at the University of Copenhagen in 1910, at first with professor Eugenius Warming, then with professor Christen Raunkiær. His doctoral dissertation (1921) was on the influence of soil pH on the natural distribution of plants. He was then employed by the Carlsberg Laboratory as an assistant to the chemist S. P. L. Sørensen, later in his own lab. There, he worked on plant uptake of ions, especially iron, nitrogen fixation and calcicolous plants.', 'title': 'Carsten Olsen'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Tikhon Alexandrovich Rabotnov (Ти́хон Алекса́ндрович Рабо́тнов; July 6, 1904 – September 16, 2000) was a Russian plant ecologist. He was professor and head of the Department of Geobotany at Moscow State University until 1981. He was a father figure to generations of Russian plant ecologists. He conducted ground breaking studies in the regeneration of natural plant communities – studies which remained largely overlooked in the West.', 'title': 'Tikhon Rabotnov'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Søren Peder Lauritz Sørensen (9 January 1868 – 12 February 1939) was a Danish chemist, famous for the introduction of the concept of pH, a scale for measuring acidity and alkalinity. He was born in Havrebjerg, Denmark.', 'title': 'S. P. L. Sørensen'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'What\'s So Amazing About Grace? is a 1997 book by Philip Yancey, an American journalist and editor-at-large for "Christianity Today". The book examines grace in Christianity, contending that people crave grace and that it is central to the gospel, but that many local churches ignore grace and instead seek to exterminate immorality. "What\'s So Amazing About Grace?" includes Bible stories, anecdotes from Yancey\'s life, accounts of historical events and other stories. These include a modern retelling of the Parable of the Prodigal Son, an account of Yancey\'s friendship with Mel White who came out as homosexual, a comparison of the teachings of early Christians Pelagius and Augustine of Hippo, and a summary of Karen Blixen\'s short story "Babette\'s Feast".', 'title': "What's So Amazing About Grace?"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Lawrence Holofcener (February 23, 1926 – March 4, 2017) was an American-British sculptor, poet, lyricist, playwright, novelist, actor and director. He held dual British and American nationality. As a singer and songwriter he was better known as Larry Holofcener. He died in March 2017 at the age of 91. . As a tribute to his transatlantic love affair with England, his obituary was printed in UK\'s "The Daily Telegraph".', 'title': 'Lawrence Holofcener'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Prodigal Judge is a novel written by American novelist Vaughan Kester and published in 1911.', 'title': 'The Prodigal Judge'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Jeffrey Howard Archer, Baron Archer of Weston-super-Mare (born 15 April 1940) is an English novelist and politician.', 'title': 'Jeffrey Archer'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The History of Rock is a compilation album released by Kid Rock in 2000, as the unofficial follow up to "Devil Without a Cause". After acquiring the rights to his indie-label recordings, Rock decided to release a compilation of older material. The album contains material from the albums "The Polyfuze Method" and "Early Mornin\' Stoned Pimp". The liner notes state that Rock re-recorded the songs from "Polyfuze" because he could not find the master recordings, and "remixed and touched up" the "EMSP" tracks to show how they would have sounded if Rock had the money to record them properly at the time. There are also three previously unreleased songs from those album sessions ("Born 2 B A Hick" from the "Polyfuze" sessions in 1992, "Dark and Grey" and "Abortion" from the "EMSP" sessions in 1994). The only new tracks were "American Bad Ass", which was the first single from the album, and "Fuck That", which had been used previously for the "Any Given Sunday" soundtrack. "Fuck U Blind" was re-written from the original version and was more funk than the original rap metal version. Foreshadowing his move out of hip hop, he remade both "Prodigal Son" and "My Oedipus Complex" as southern rock songs. Even though they were recorded in 1992, "Born 2 B A Hick" was a rockabilly song and "Abortion" was a dark blues ballad.', 'title': 'The History of Rock'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Ezekiel 16 is the sixteenth chapter of the Book of Ezekiel in the Hebrew Bible or the Old Testament of the Christian Bible. This book contains the prophecies spoken by the prophet Ezekiel, and is a part of the Books of the Prophets. Clements calls this chapter "an Old Testament parable of the prodigal daughter", describing a shocking illustration eof ungrateful Jerusalem in contrast to God\'s enduring love to her. This chapter is often linked to Ezekiel 23 which deals with two daughters, symbolizing the Kingdoms of Israel and Judah.', 'title': 'Ezekiel 16'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Prodigal Daughter" is the 161st episode of the television series "", the 11th episode of the .', 'title': 'Prodigal Daughter (Star Trek: Deep Space Nine)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Prodigal Daughter is a novel by Jeffrey Archer, published in 1982. It is the story of Florentyna Kane, the daughter of Abel Rosnovski of Archer\'s "Kane and Abel". The novel, one of Archer\'s best sellers, portrays Florentyna\'s life from early childhood to her final ascension to the position of President of United States. In this way, President Kane becomes the first female U.S. president.', 'title': 'The Prodigal Daughter'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Eloy Urroz is a Mexican writer and Professor of Spanish and Latin American Literature at The Citadel in South Carolina. Though born in New York, Urroz grew up in Mexico City and is of Mexican nationality. He is one of the founding members of the Crack Movement, along with such writers as Ignacio Padilla and Jorge Volpi. Urroz has written eight novels, four books on literary criticism, four books of poetry, three political reportages and dozens of essays, articles, and reviews on Latin American and Peninsular Culture and Literature. Some of his novels have been translated into English, French, Italian, Portuguese, and German. In the United States, his novels are published by Dalkey Archive Press.', 'title': 'Eloy Urroz'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Michèle Brigitte Roberts (born 20 May 1949) is a British writer, novelist and poet. She is the daughter of a French Catholic teacher mother (Monique Caulle) and English Protestant father (Reginald Roberts), and has dual UK–France nationality.', 'title': 'Michèle Roberts'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Guerra de Titanes (Spanish for "War of the Titans") was a professional wrestling pay-per-view (PPV) event produced by the AAA promotion, which took place on December 16, 2011, at "Estadio Hermanos Serdán" in Puebla, Puebla, Mexico. The event was the fifteenth "Guerra de Titanes" end of the year show promoted by AAA since 1997. The event included appearances by Total Nonstop Action Wrestling (TNA) wrestlers A.J. Styles, D\'Angelo Dinero, Gunner and Rob Terry as part of the ongoing storyline invasion of wrestlers from the American promotion. The pay-per-view was headlined by a match for the AAA Latin American Championship, between champion Dr. Wagner Jr. and challenger L.A. Park. The conclusion of the match led to the AAA debuts of Máscara Año 2000 Jr., El Texano Jr. and Toscano, starting a new storyline, where the three posed as invaders from rival promotion Consejo Mundial de Lucha Libre (CMLL).', 'title': 'Guerra de Titanes (2011)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': '"Guerra de Titanes" (2009) ("War of the Titans") was the thirteenth annual "Guerra de Titanes" professional wrestling show promoted by AAA since 1997. The show took place on December 11, 2009 in the Ciudad Madero, Tamaulipas Convention center, a site that AAA has used for many of their major shows. "Guerra de Titanes" is AAA\'s "End of year" show and the fifth of their "big shows" they hold every year. The Main Event saw Dr. Wagner Jr. defend the AAA Mega Championship against El Mesias in a "Domo De La Muerte" cage match. The show also featured two AAA championship matches as Nicho el Millonario and Joe Líder defended the AAA World Tag Team Championship and Mini Charly Manson defended the AAA World Mini-Estrella Championship. Furthermore a "Mask vs. Hair", Lucha de Apuesta match between Faby Apache and Sexy Star took place as well. Finally the show featured a Six-man "Lucha Libre rules" tag team match and a four on four "AAA vs. "La Legion Extranjera" elimination match where the winner would receive a title match for the AAA Mega Championship as AAA\'s 2010 "Rey de Reyes" show.', 'title': 'Guerra de Titanes (2009)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Guerra de Titanes" (1997) ("War of the Titans") was the first ever "Guerra de Titanes" professional wrestling show promoted by AAA. The show took place on December 13, 1997 in Ciudad Madero, Mexico. The Main event featured a "Lucha de Apuestas" "hair vs. hair" match contested inside a Steel Cage between the teams of Heavy Metal and Perro Aguayo Jr. and Picudo and Sangre Chicana.', 'title': 'Guerra de Titanes (1997)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Guerra de Titanes (Spanish for "War of the Titans") was a major professional wrestling event scripted and produced by Lucha Libre AAA World Wide (AAA), a Mexican promotion. The event was the twentieth annual "Guerra de Titanes" show which, until 2015, has traditionally been AAA\'s "end of the year" show. In 2016 the show was shifted from December to January instead. The show was held in "Gimnasio Juan de la Barrera" in Mexico City, Mexico which also hosted the 2016 "Guerra de Titanes" show.', 'title': 'Guerra de Titanes (2017)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Guerra de Titanes" (2000) ("War of the Titans") was the fourth "Guerra de Titanes" professional wrestling show promoted by AAA. The show took place on December 8, 2000 in Madero, Mexico. The Main event featured an "Extreme" Steel Cage Match Tag Team match that featured Héctor Garza and Latin Lover taking on Heavy Metal and Perro Aguayo Jr.', 'title': 'Guerra de Titanes (2000)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"Guerra de Titanes" (2001) ("War of the Titans") was the fifth "Guerra de Titanes" professional wrestling show promoted by AAA. The show took place on November 23, 2001 in Mexico City, Mexico. The Main event featured a "Four Way" Elimination "Lucha de Apuestas" which meant that the loser would have his hair shaved off. The participants were Heavy Metal lost to Perro Aguayo Jr., Héctor Garza and Latin Lover, who had all competed in the main event of "Guerra de Titanes" 2000 as well.', 'title': 'Guerra de Titanes (2001)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Guerra de Titanes" (1999) ("War of the Titans") was the third "Guerra de Titanes" professional wrestling show promoted by AAA. The show took place on December 10, 1999 in Madero, Mexico. The Main event featured a "Lucha de Apuestas" "mask vs. mask" under Street fight rules. Octagón faced Jaque Mate to see which wrestler had to unmask.', 'title': 'Guerra de Titanes (1999)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Guerra de Titanes ("War of the Titans") was the tenth "Guerra de Titanes" professional wrestling show promoted by AAA. The show took place on December 8, 2006 in Madero, Mexico. The Main event featured "extreme coffin" match between Cibernético and El Mesias, with Konnan serving as special referee in the match.', 'title': 'Guerra de Titanes (2006)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Guerra de Titanes" (2008) ("War of the Titans") was the twelfth annual "Guerra de Titanes" professional wrestling show promoted by AAA. The show took place on December 6, 2008 in Orizaba, Mexico, the same venue used for the 2006 and 2007 events. The Main event featured a Ladder match for the vacant AAA Mega Championship between El Mesias and El Zorro and saw Mesias win the match to become a two time champion. In addition to the main event the show featured a Steel Cage Match "Lucha de Apuestas" where the last man left in the cage would have his hair shaved off. The participants in the cage match were brothers El Brazo and Brazo de Plata as well as Pirata Morgan, Electroshock, Super Fly and El Elegido and saw El Brazo shaved bald as a result of his loss. As is tradition with AAA major events the wrestlers compete inside a hexagonal wrestling ring and not the four sided ring the promotion uses for television events and House shows.', 'title': 'Guerra de Titanes (2008)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Dulce Maria García Rivas (born September 20, 1982) is a Mexican "Luchadora" "enmascarada", or masked female professional wrestler, and professional boxer who is better known by the ring name Sexy Star. She is best known for her work in Lucha Libre AAA Worldwide (AAA), where she is a three-time AAA Reina de Reinas Champion, while also being a former one-time AAA World Mixed Tag Team Champion. She previously wrestled under the name Dulce Poly and held both the FILL Women\'s Championship and the FILL Mixed Tag Team Championship under that name. She worked for Lucha Underground, where she was a former Lucha Underground Champion and Gift of the Gods Champion. She is the first woman to win the Lucha Underground Championship.', 'title': 'Sexy Star'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Men's Doubles tournament at the 1983 Wimbledon Championships was held from August 30 to September 11, 1983, on the outdoor grass courts at the All England Lawn Tennis and Croquet Club in the Wimbledon district of London, England. Peter McNamara and Paul McNamee were the defending champions. Peter McNamara did not compete this year while McNamee partnered with Brian Gottfried, losing in the quarterfinals to Anders Jarryd and Hans Simonsson. Peter Fleming and John McEnroe won the title, defeating Tim Gullikson and Tom Gullikson in the final.", 'title': "1983 Wimbledon Championships – Men's Doubles"}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Tom Gullikson (born September 8, 1951) is a tennis coach and former professional tennis player from the United States.', 'title': 'Tom Gullikson'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Jürgen Melzer and Philipp Petzschner were the defending champions, but lost in the second round to Jamie Delgado and Ken Skupski. Melzer and Petzschner needed a wildcard to compete because they forgot to sign up. <br>', 'title': "2012 US Open – Men's Doubles"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Julian Knowle and Jürgen Melzer were the defending champions, but Melzer chose not to participate this year.As a result, Knowle partnered with Andy Ram, but they lost to Robert Lindstedt and Horia Tecău in the semifinals. Lindstedt and Tecău went on to win the tournament, after defeating Rohan Bopanna and Aisam-ul-Haq Qureshi in the final 6–4, 7–5.', 'title': "2010 Pilot Pen Tennis – Men's Doubles"}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Jürgen Melzer (born 22 May 1981 in Vienna) is an Austrian tennis player. He reached a career-high singles ranking of world No. 8 in April 2011, and a doubles ranking of world No. 6 in September 2010. He is a left-handed tennis player, but is right-handed in everyday life. He has a younger brother, Gerald Melzer, with whom he has played doubles in several tournaments.', 'title': 'Jürgen Melzer'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Iveta Benešová (] ) (formerly Melzer, Czech: Melzerová ; born 1 February 1983) is a Czech former professional tennis player. She began playing tennis at age of 7 and turned professional in 1998 in Prague. She has won two WTA Tour events and one Grand Slam in mixed doubles partnering with Jürgen Melzer at the 2011 Wimbledon Championships. On 14 September 2012 she married Jürgen Melzer and adopted his family name. She announced her retirement from professional tennis via her Facebook page 13/08/2014. In 2015, she divorced Melzer and reverted to using her maiden name.', 'title': 'Iveta Benešová'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Tim Gullikson and Tom Gullikson were the defending champions, but Tim Gullikson did not participate this year. Tom Gullikson partnered Johan Kriek, losing in the final.', 'title': '1983 Bristol Open – Doubles'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Julian Knowle (born 29 April 1974) is an Austrian male professional tennis player. Being a born left-hander, Knowle is now one of the few on the ATP Tour who plays his forehand, backhand, and even volleys double-handed. He was Austria's most successful doubles player in history by reaching world no. 6 in the ATP doubles rankings in January 2008, before being matched by Jürgen Melzer, who reached no. 6 in September 2010, and overtaken by Alexander Peya, who reached no. 3 in August 2013.", 'title': 'Julian Knowle'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Pam Teeguarden (born April 17, 1951) is a former American professional tennis player in the 1970s and 1980s, ranked in the top 20 from 1970–1975, according to "John Dolan\'s Women\'s Tennis Ultimate Guide", prior to computer rankings. She won two Grand Slam Doubles Titles and was a quarter finalist in singles at the U.S. Open and The French Open. Her father Jerry, a well known coach, helped Margaret Court win the coveted Grand Slam (all four Grand Slam titles in one year) in 1970 and Virginia Wade to her 1977 Wimbledon triumph. Teeguarden was voted the "Most Watchable Player" based on play and appearance by a group of Madison Avenue advertising executives or "Mad Men" while playing at the US Open. Teeguarden played in 19 consecutive US Opens, holding the record until Chris Evert played in 20. She wore the first all black outfit in the history of tennis in 1975 at The Bridgestone Doubles Championships in Tokyo, starting a trend that is still popular today. Teeguarden was the first woman tennis player signed by Nike. She played on the victorious Los Angeles Strings Team Tennis team in 1981 and won the Team Tennis Mixed Doubles Division with Tom Gullikson in 1977; they were also runners-up in the league that year.', 'title': 'Pam Teeguarden'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Gerald Melzer (born 13 July 1990) is a professional Austrian tennis player. As a qualifier, he reached the semifinals of Münich in 2015. He achieved a career-high singles ranking of world No. 68 in November 2016.', 'title': 'Gerald Melzer'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Shade gardens are gardens planted and grown in areas with little or no direct sunlight. Shade gardens may occur naturally or by design under trees, as well as on the side of buildings or fences. This style of garden presents certain challenges, in part because only certain plants are able to grow in shady conditions and otherwise there is direct competition for sunlight. Very few edible plants grow well in shady conditions, so shade gardens are usually ornamental gardens, though growing flowers may also be difficult in shade. Light shade, also known as "dappled sunlight", may support growing herbs or some leaf vegetables, but in addition to lack of light, trees and other large plants which create shade gardens may negatively impact soil fertility.', 'title': 'Shade garden'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Melodorum siamense (Taxonomic synonym "Rauwenhoffia siamensis"; called in local Thai name as nom-maew) is a plant in the family Annonaceae. "Melodorum siamense" is a small tree, related to the ylang-ylang. It is successfully grown in containers and is easy in care, blooming from spring till fall. Despite their plainness, the flowers of Melodorum distribute their fine perfume to great distances. It is for this that Asian gardeners include it with pleasure among their favorite garden plants. This plant can tolerate some shade; however, the lack of sunlight adversely affects flowering.', 'title': 'Melodorum siamense'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'National Botanic Garden of Israel (official name: The Botanical Garden for the Native Plants of Israel in memory of Montague Lamport, in Hebrew: הגן הבוטני לצמחי ארץ ישראל ע"ש מונטג\'יו למפורט) is a botanical garden located in the Hebrew University of Jerusalem – Mount Scopus campus. it is the first botanical garden in the Land of Israel and records all the wild plants of Israel and the Middle East. The garden is located in the northern part of the Hebrew University campus on Mount Scopus in Jerusalem. around the garden are many burial caves from the Second Temple period. in the western part of the garden is a small amphitheater. The garden is also a Ecological nature reserve and National park it contains: Natural Teaching Center, a Library that is largest botanical library in Israel, and a meteorological station. on the western side of the garden is Trail walk named after the Israeli author Avigdor Hameiri. in the center of the Trail, next to the main entrance is a stone tablet inscribed with his famous song poem "On the summit of Mount Scopus".', 'title': 'National Botanic Garden of Israel'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Miracle-Gro AeroGarden is a smart countertop indoor garden made by AeroGrow International. The AeroGarden features proprietary technology which helps consumers grow fresh herbs, vegetables, salad greens and more indoors, year-round, using hydroponics. The seeds come in special seed pods, or consumers can use their own seeds with a custom kit. The plants receive artificial sunlight with built in, full spectrum CFL or LED grow lights that turn on and off automatically. Most AeroGardens have an adjustable light hood that can be used to grow taller plants, such as tomatoes. The AeroGarden comes in several different designs, colors and sizes, accommodating three, six, seven or nine seed pods at one time. All of the AeroGardens make use of liquid nutrient that is mixed into the water reservoir. Reminders tell the user when to add water and the patented liquid nutrients. Using hydroponics, roots soak in nutrient-rich water and no soil is needed. AeroGarden comes with plastic domes to put over seed pods to encourage germination, however, these can cause excessive humidity and cause mold if kept on too long.', 'title': 'Miracle-Gro AeroGarden'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Alseuosmia macrophylla, the toropapa or karapapa, is a plant species in the family Alseuosmiaceae. This is a small evergreen shrub which is endogenous to New Zealand, along with two closely related species. An example occurrence of "A. macrophylla" is in the North Island habitat of the Hamilton Ecological District, where "Blechnum discolor" and "Blechnum filiforme" are understory elements with "Nothofagus truncata" and rimu overstory. This plant is known for the pleasant scent of its flowers, and its family name translates as "perfumed grove". The small red berries of toropapa are edible and sweet tasting. As a forest understory plant, toropapa will not tolerate full sunlight or frost, and needs its roots to stay moist and cool, however so long as these conditions are met it is reasonably hardy, and is sometimes cultivated as a garden plant.', 'title': 'Alseuosmia macrophylla'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Frederick Louis MacNeice CBE (12 September 1907 – 3 September 1963) was an Irish poet and playwright. He was part of the generation of the Auden Group that included W. H. Auden, Stephen Spender and Cecil Day-Lewis. MacNeice's body of work was widely appreciated by the public during his lifetime, due in part to his relaxed, but socially and emotionally aware style. Never as overtly (or simplistically) political as some of his contemporaries, his work shows a humane opposition to totalitarianism as well as an acute awareness of his Irish roots.", 'title': 'Louis MacNeice'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The Sunlight on the Garden is a 24-line poem by Louis MacNeice. It was written in late 1936 and was entitled "Song" at its first appearance in print, in The Listener magazine, January 1937. It was first published in book form as the third poem in MacNeice\'s poetry collection The Earth Compels (1938). The poem explores themes of time and loss, along with anxiety about the darkening political situation in Europe following the outbreak of the Spanish Civil War. It is one of the best known and most anthologized of MacNeice\'s short poems. George Macbeth describes it as "one of MacNeice\'s saddest and most beautiful lyrics".', 'title': 'The Sunlight on the Garden'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Kathleen Cambor is an American author. Her novels include "The Book of Mercy", which received the Janet Heidinger Kafka Prize and was a finalist for the PEN/Faulkner Award for Fiction. She was awarded a Guggenheim Fellowship in 2001 for her second novel, "In Sunlight, In a Beautiful Garden". The novel was selected as a New York Times Notable Book of 2001.', 'title': 'Kathleen Cambor'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Jenni Fagan is a Scottish novelist best known for "The Panopticon" published in 2012. In 2013, Fagan was named in the Granta list of Best Young British Novelists, and it was announced that The Panopticon is to be made into a film by Sixteen Films. Fagan\'s second fiction novel — "The Sunlight Pilgrims" was published in the UK & US in 2016. Fagan was selected as Sunday Herald Culture Awards Scottish Author of the Year 2016. "The Sunlight Pilgrims" is currently on the long list for the Saltire Prize. "The Dead Queen of Bohemia" (New & Collected Poems) was also published in 2016. Fagan is currently translated into eight languages. Both of her novels made the front cover of The New York Times Book Review. Fagan has received international critical acclaim. Fagan\'s work is widely supported within the literary community around the world.', 'title': 'Jenni Fagan'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Paul Allen Smith is a television host, garden designer, conservationist, and lifestyle expert. He is the host of three television programs. "P. Allen Smith\'s Garden Home" and "P. Allen Smith\'s Garden to Table" are distributed to public television by American Public Television. His 30-minute show "Garden Style" is in syndication. Smith is one of America\'s most recognized gardening and design experts, providing ideas and guidance through multiple media venues. He is the author of the Garden Home series of books published by Clarkson Potter/Random House, including "Bringing the Garden Indoors: Container, Crafts and Bouquets for Every Room" and the cookbook, "Seasonal Recipes from the Garden", inspired by the abundance of food from his farm and a family of cooks. In 2014, Smith\'s television shows were successful at the Taste Awards with Smith returning to Little Rock with four Taste Awards. In 2015, Smith was inducted into the\xa0Taste\xa0Hall\xa0of\xa0Fame\xa0for his significant impact in the world of\xa0taste\xa0and broadcast entertainment. "Garden Home" won a 2017 Taste Award for “Best Green or Organic Program.”', 'title': 'P. Allen Smith'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Gábor Csupó ( ; ] ; born September 29, 1952) is a Hungarian animator, writer, director, producer and graphic designer. He is co-founder of the animation studio Klasky Csupo, which has produced shows like "Rugrats", "Duckman", and "Aaahh!!! Real Monsters".', 'title': 'Gábor Csupó'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Melnitsa Animation Studio (Russian: Студия анимационного кино «Мельница» , "melnitsa" meaning "windmill") is one of the largest animation studios in Russia. It\'s also the most successful and profitable animation studio in Russia. Deutsche Welle called the studio the Walt Disney of Saint Petersburg. Alongside its animation projects, Melnitsa has an effort devoted to creating digital special effects for both animation projects and live-action films.', 'title': 'Melnitsa Animation Studio'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Bill Schultz (born June 11, 1960) is an animation producer. He was born in New York City and grew up in River Forest, a suburb near Chicago, Illinois, moving to Los Angeles after graduating from the University of Illinois Champaign - Urbana Campus. He has worked on television shows such as "Jim Henson\'s Muppet Babies", "The Transformers", and produced others, notably "The Simpsons", "King of the Hill" and now the founder and CEO of Home Plate Entertainment, the Animation Studio behind Rob Dyrdek\'s Wild Grinders (launched on Nicktoons in the US in September 2011). Schultz started Home Plate Entertainment in 2010, after stepping down from his 12 year partnership with Moonscoop LLC (f/k/a Mike Young Productions (MYP) and Taffy entertainment, the US based arm of French animation studio Moonscoop SAS.', 'title': 'Bill Schultz (producer)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'P.A.Works Corporation (株式会社ピーエーワークス , Kabushiki-gaisha Pī Ē Wākusu , short for Progressive Animation Works) is a Japanese animation studio established on November 10, 2000 and is located in Nanto, Toyama, Japan. The company\'s president and founder Kenji Horikawa once worked for Tatsunoko Production, Production I.G, and Bee Train before forming P.A.Works in 2000. The main office is located in Toyama, Japan, which is where the drawing and digital photography take place, and production and direction takes place in their Tokyo office. The company is also involved with animation in video games, as well as collaborating in the past with Production I.G and Bee Train to create anime. In January 2008, P.A.Works produced "True Tears", their first anime series as the main animation studio involved in the production process.', 'title': 'P.A.Works'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The Secret of Moonacre is a 2009 fantasy film based on the novel "The Little White Horse" by Elizabeth Goudge. The film was directed by Gábor Csupó and starred Dakota Blue Richards in the leading role. The film premiered at the 2008 Toronto International Film Festival and was released in the United Kingdom on 6 February 2009 by Warner Bros.', 'title': 'The Secret of Moonacre'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'G&G Entertainment (Korean: (주)지앤지엔터테인먼트 )is a South Korean/Japanese animation studio which creates animation for the domestic South Korean and Japanese anime markets. The main studio, which is credited as G&G Entertainment, is located in South Korea, while the Japanese subsidiary studio, which is credited as G&G Direction, assists the main studio and aids in getting outsource work from other Japanese studios. G&G Entertainment is known for its collaboration with the Japanese animation studio Gonzo, with which they have produced their most successful series to date, Kaleido Star. Increasingly, the studio is also seeking collaborations with Chinese studios, particularly for the creation of computer animation productions.', 'title': 'G&amp;G Entertainment'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'PAJ animation studio is a persian animation film studio based in IRAN. The studio produced several short films, television commercials, and one feature film. It was founded on 30 October 2007. PAJ animation studio produced a mini series called the hidden lives in 2017 .', 'title': 'PAJ animation studio'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'John Lemmon Films is a traditional character animation studio based in Charlotte, North Carolina, United States, and is listed among five “prominent animation houses”. The company was founded in 1984 by John Lemmon and Mike Rosinski. Initially the animation studio worked exclusively in clay animation, but has since diversified into stop-motion, 2D animation and Flash animation, as well as web game design. The company has produced clay animated TV commercials for clients including: Disney, Cartoon Network and Dairy Queen. The studio has created clay-animated versions of well-known products, including the Coleman lantern, and has produced clay animated spots for Tandy Corporation’s chain of stores called McDuff Electronics and for Cedar Point.', 'title': 'John Lemmon Films'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Jesper Moller (Danish: "Møller") is a Danish Animator, Screenwriter and Movie-director. Since beginning his career in animation and the movies in the late 1980s, Jesper Moller has participated in creating a vast number of Danish, European and American animated feature films (see below). After initially working as character animator at Sullivan Bluth Studios under the direction of animation legend Don Bluth, he joined Danish animation studio A. Film A/S in Copenhagen, Denmark. Amassing credits as directing animator, storyboard artist and character designer, he went on to become a central key in establishing A. Film A/S as Europe’s leading feature animation studio and a household name at the majors in the US. After a period as the creative head of Feature Animation, also acting as sequence director on several films, he went on to co-direct (with Stefan Fjeldmark) the 2006 cinema hit Asterix and the Vikings, based on R. Goscinny and A. Uderzo\'s legendary comic book.', 'title': 'Jesper Møller'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'DR Movie is a Korean animation studio that was established in Seoul in 1990 and frequently works with Japanese companies on anime titles. Since 1991, the studio has been in an exclusive partnership with the Japanese animation studio Madhouse, and in 2001, Madhouse became a partial owner/investor. In 2006, Madhouse\'s parent company Index Holdings invested 600 million yen. DR Movie has been responsible for the animation production end of several Madhouse anime, starting with "Tenjho Tenge" in 2004 and continuing notably with "Claymore" in 2007. DR Movie has also been looking to make partnerships with Chinese animation companies for future productions, and as of March 2007 entered into a joint venture studio in Qingdao, China.', 'title': 'DR Movie'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The infighting in the Gulf Cartel refers to a series of confrontations between the Metros and the Rojos, two factions within Gulf Cartel that engaged in a power struggle directly after the death of the drug lord Samuel Flores Borrego in September 2011. The infighting has lasted through 2013, although the Metros have gained the advantage and regained control of the major cities controlled by the cartel when it was essentially one organization.', 'title': 'Infighting in the Gulf Cartel'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Homero Enrique Cárdenas Guillén (13 March 1966 – allegedly died on 28 March 2014), also known by his aliases El Majadero and El Orejón, was a Mexican suspected drug lord and alleged leader of the Gulf Cartel, a drug trafficking organization. He is the brother of the former Gulf Cartel leaders Antonio, Mario, and Osiel Cárdenas Guillen. During the late 1990s, Homero worked for the Gulf Cartel under the tutelage of his brothers. However, after several years of government crackdowns, the Gulf Cartel suffered severe drawbacks, including the death and arrests of Homero's brothers and allies. In August 2013, Homero became the de facto leader of the Gulf Cartel following the arrest of Mario Ramírez Treviño. However, he reportedly died of a heart attack on 28 March 2014.", 'title': 'Homero Cárdenas Guillén'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Los Mexicles is a Mexican street gang, who work as armed wings for two of Mexican drug cartels, Sinaloa Cartel and Gulf Cartel. For the Gulf Cartel, they work in South Texas and Rio Grande Valley as armed wing and drug traffickers and dealers. For the Sinaloa Cartel, they work in Ciudad Juárez as assassins for the cartel.', 'title': 'Los Mexicles'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Óscar Malherbe de León (born 10 January 1964) is an imprisoned Mexican drug lord and former high-ranking leader of the Gulf Cartel, a drug trafficking organization. He was the main intermediary of the Gulf Cartel in Colombia, responsible for shipping large sums of cocaine from the Cali Cartel in the 1990s.', 'title': 'Óscar Malherbe de León'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Juan Nepomuceno Guerra Cárdenas (July 18, 1915 – July 12, 2001) was a Mexican crime lord, bootlegger, businessman and smuggler who founded the Gulf Cartel, a drug trafficking organization. He is often considered the "godfather" of U.S-Mexico border cartels.', 'title': 'Juan Nepomuceno Guerra'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Osiel Cárdenas Guillén (born May 18, 1967) is a former Mexican drug lord and the former leader of the Gulf Cartel (Spanish: "Cártel del Golfo" ) and Los Zetas. Originally a mechanic in Matamoros, Tamaulipas, where he was born, he entered the Gulf Cartel by helping Juan García Abrego, the capo at the time; when García Ábrego was arrested in 1996, some infighting erupted within the cartel. Osiel Cárdenas eventually took control by killing his friend and contender Salvador Gómez, earning Cárdenas the nickname ""El Mata Amigos"" (The Friend-Killer).', 'title': 'Osiel Cárdenas Guillén'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Samuel Flores Borrego (a.k.a. Metro 3) (6 August 1972 – 2 September 2011) was a Mexican drug lord and high-ranking lieutenant of the Gulf Cartel. He was a former state judicial policeman who protected the ex-leader of the Gulf cartel, Osiel Cárdenas Guillén. Upon his arrest, Flores Borrego became the right-hand man of Jorge Eduardo Costilla Sánchez, the former leader of the criminal organization.', 'title': 'Samuel Flores Borrego'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Juan García Ábrego (born September 13, 1944) is a former Mexican drug lord who started out his criminal career under the tutelage of his uncle Juan Nepomuceno Guerra, who is reported to be the former head of a criminal dynasty along the U.S.-Mexico border now called the Gulf Cartel.', 'title': 'Juan García Ábrego'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 2012 Nuevo Laredo massacres were a series of mass murder attacks between the allied Sinaloa Cartel and Gulf Cartel against Los Zetas in the border city of Nuevo Laredo, Tamaulipas, across the U.S.-Mexico border from Laredo, Texas. The drug-violence in Nuevo Laredo began back in 2003, when the city was controlled by the Gulf Cartel. Most media reports that write about the Mexican Drug War, however, point to 2006 as the start of the drug war. That year is a convenient historical marker because that's when Felipe Calderón took office and carried out an aggressive approach against the cartels. But authors like Ioan Grillo and Sylvia Longmire note that Mexico's drug war actually began at the end of Vicente Fox's administration in 2004, when the first major battle took place in Nuevo Laredo between the Sinaloa Cartel and Los Zetas, who at that time worked as the armed wing of the Gulf Cartel.", 'title': '2012 Nuevo Laredo massacres'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Joint Operation Nuevo León-Tamaulipas is an anti-drug joint operation in two Mexican states of Tamaulipas and Nuevo León by Federal Police and the Mexican Armed Forces. The objective of the joint operation is to eliminate Los Zetas and Gulf Cartel operations in the area. So far a large number of cartel members have been either killed or arrested. Recently Los Zetas and the Gulf Cartel have broken relations and started fighting each other.', 'title': 'Joint Operation Nuevo León-Tamaulipas'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Sharleen Eugene Spiteri (born 7 November 1967) is a Scottish recording artist and songwriter from Finnieston, Glasgow, Scotland, and the lead singer of the rock band Texas. In 2013, Texas's worldwide album sales were counted at 40 million.", 'title': 'Sharleen Spiteri'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'This is the discography for Scottish alternative rock singer, Sharleen Spiteri. For her work within the Scottish rock band Texas, see Texas discography. Her debut solo album "Melody" was released in 2008 and charted at number 3 on the UK Albums Chart. Her second solo album, "The Movie Songbook", was released on 1 March 2010.', 'title': 'Sharleen Spiteri discography'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Burton Lorne Cummings, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (born December 31, 1947) is a Canadian musician, singer and songwriter.', 'title': 'Burton Cummings'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'First Contact is the debut studio album by American house producer Roger Sanchez, released in July 2001 by Defected Records. After establishing himself as a popular DJ and remixer throughout the 1990s, Sanchez decided he wanted to create more of his own music and record a studio album, feeling he had "a bit of a story to tell with [his life]," and conceived the album to be a very personal "reflection of his life", recording the album from 1997–2001. Music critics have described "First Contact" as a disco house album which displays a disparate array of influences and styles, including garage, Latin and electro. Numerous guest vocalists, including Cooly\'s Hot Box, N\'Dea Davenport and Sharleen Spiteri, contribute vocals to the album.', 'title': 'First Contact (album)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Stop I Don\'t Love You Anymore" is the second single from Sharleen Spiteri\'s first solo album "Melody". It was slated for a September 29, 2008 release, but then for unknown reasons it was pushed back and finally got released on October 6, 2008 as a digital download only single. This song failed to chart inside the top 100 UK singles, peaking only at #107.', 'title': "Stop, I Don't Love You Anymore"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Red Book is the seventh album from Scottish rock band Texas. It was released on 7 November 2005 and entered the UK Albums Chart at #16. It is named after the little red book that singer Sharleen Spiteri used to write the album songs. The album yielded two UK Top Ten singles, "Getaway" and "Sleep" and the UK Top 20 single, "Can\'t Resist". Four of the album\'s tracks were co-written with Brian Higgins of Xenomania — "Can\'t Resist", "Cry", "Get Down Tonight" and "Bad Weather".', 'title': 'Red Book (album)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"It Was You" is the third single released off Sharleen Spiteri\'s first solo album "Melody". It was originally rumoured to be the second single due to it being on the albums sticker but it turned out to be "Stop, I Don\'t Love You Anymore", it was later announced to be the third single on Sharleen Spiteri\'s official website, it was released as digital download on December 1, 2008, following the single "Stop, I Don\'t Love You Anymore".', 'title': 'It Was You'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Movie Songbook is the second studio album by Scottish singer-songwriter Sharleen Spiteri. It was released on 1 March 2010. The album consists of film song covers, chosen and recorded by Spiteri in 2009.', 'title': 'The Movie Songbook'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"All the Times I Cried" is the debut solo single by Texas lead singer, Sharleen Spiteri, from her debut solo album, "Melody". It was digitally released in the U.K. on June 30, 2008, and physically released on July 7, 2008. It was taken from The Shangri Las song \'Out In The Streets\'.', 'title': 'All the Times I Cried'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Conversation is the eighth album from Scottish rock band Texas. It was released on 20 May 2013. Tracks are written mainly by Sharleen Spiteri and Johnny McElhone, with Richard Hawley and Bernard Butler as collaborators. "The Conversation" is the group\'s first studio album of new material since "Red Book" in 2005. Title track "The Conversation" was released as the first single from the album in April 2013, followed by up-beat Pop Rock "Detroit City", both of which received a decent amount of UK airplay, including on BBC Radio 2\'s playlist.', 'title': 'The Conversation (Texas album)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Farming Game is a board game simulating the economics of a small farm. Published in 1979, it was designed by George Rohrbacher, a rancher in Washington State. "The Farming Game" painfully reflects the real-life difficulties of running a farm. Also, the names and places in the game are the names of families farming for generations in Yakima Valley and other parts of Central Washington. When Rohrbacher invented the game, it was a desperate time for his failing farm and small family, which is reflected in the difficulty of the game, and the multitude of points taken into consideration in farming that are often left up to chance. It is considered a board game which has educational value.', 'title': 'The Farming Game'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Feng Shui is a martial arts-themed role-playing game, designed by Robin Laws, published first by Daedalus Entertainment and now by Atlas Games. The game shares its setting with the collectible card game "Shadowfist". The system is simple, with most detail being in the game\'s combat system. Combat is made to flow quickly, moving from one action scene to another very quickly. It was inspired and based on Hong Kong style action movies.', 'title': 'Feng Shui (role-playing game)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Hay Day is a freemium mobile farming game developed and published by Supercell. Hay Day was released for iOS on June 21, 2012 and Android on November 20, 2013. According to a 2013 report, Supercell earned $30 million a month from Hay Day and Clash of Clans, another game made by Supercell. In 2013, Hay Day was the 4th highest game in revenue generated.', 'title': 'Hay Day'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Under a Cruel Star: A Life in Prague 1941-1968 was published first under this title by Plunkett Lake Press, Cambridge, Massachusetts in 1986. The memoir was written by Heda Margolius Kovály and translated with Franci and Helen Epstein. It is now available in a Holmes & Meier, New York 1997 edition (ISBN\xa0 ), in a Plunkett Lake Press 2010 eBook edition and in a Granta, London 2012 edition (ISBN\xa0 ). "Prague Farewell" was the book title in the UK in previous editions. The memoir was originally written in Czech and published in Canada under the title "Na vlastní kůži" by 68 Publishers, a well-known publishing house for Czech expatriates, in Toronto in 1973. An English translation appeared in the same year as the first part of the book "The Victors and the Vanquished" published by Horizon Press in New York. A British edition of the book excluded the second treatise and was published by Weidenfeld and Nicolson under the title "I Do Not Want To Remember" in 1973. The book is also available in Chinese (ISBN\xa0 ), Danish (ISBN\xa0 ), Dutch (ISBN\xa0 ), French (ISBN\xa0 ), German (ISBN\xa0 ), Romanian (ISBN\xa0 ), Spanish (ISBN\xa0 ) and the original Czech editions (ISBN\xa0 ).', 'title': 'Under a Cruel Star'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Outland is a platform game developed by Housemarque and published by Ubisoft. The game combines two-dimensional platforming with a polarity system similar to Treasure\'s "Ikaruga" and "Silhouette Mirage". "Outland" was released in April 27, 2011 for Xbox Live Arcade. The PlayStation 3 version was delayed because of the PlayStation Network outage then later released on June 14, 2011. A Windows version was released on September 29, 2014. The Linux version was released on February 25, 2015.', 'title': 'Outland (video game)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Ranch Rush 2 is a time management farming game that was first released by FreshGames on April 27, 2010 on the PC, then later for MAC and the Apple iPad. "Ranch Rush 2" is a direct sequel to the 2008 title "Ranch Rush".', 'title': 'Ranch Rush 2'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Family Farm Seaside, one of the top grossing mobile games developed and published by Beijing based videogame company FunPlus, is a farming game available for free on both iOS and Android platforms, and available in 18 languages.', 'title': 'Family Farm Seaside'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Knight Tyme is a computer game released for the ZX Spectrum, Amstrad CPC, Commodore 64 and MSX compatibles in 1986. It was published by Mastertronic as part of their Mastertronic Added Dimension label. Two versions of the ZX Spectrum release were published: a full version for the 128K Spectrum (which was published first) and a cut-down version for the 48K Spectrum that removed the music, some graphics and some locations (which was published later).', 'title': 'Knight Tyme'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "International Superstar Soccer Deluxe (officially abbreviated as ISS Deluxe and known as Jikkyou World Soccer 2: Fighting Eleven in Japan) is a football video game and the sequel to International Superstar Soccer developed and published Konami's, KCEO division. The Deluxe version was published first to the SNES, then the Mega Drive and finally the PlayStation.", 'title': 'International Superstar Soccer Deluxe'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Polarity is a board game that requires strategic thinking and dexterity to control hovering magnetic discs. "Polarity" was invented in 1985 by Canadian artist and designer Douglas Seaton. It was first published in 1986. The game has had a tumultuous past, with its rights changing hands several times over the past two decades. The game has been published by Telemotion Technologies, Irwin Toy, briefly with Mattel and most recently by Temple Games. The game ships in a canvas sleeve and include the magnets, the board, and a paper rulebook. An unrelated game of the same name is published by a company called Mindwalk (Company).', 'title': 'Polarity (game)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Heart of Darkness (1899) is a novella by Polish-British novelist Joseph Conrad, about a voyage up the Congo River into the Congo Free State, in the heart of Africa, by the story's narrator Charles Marlow. Marlow tells his story to friends aboard a boat anchored on the River Thames, London, England. This setting provides the frame for Marlow's story of his obsession with the ivory trader Kurtz, which enables Conrad to create a parallel between London and Africa as places of darkness.", 'title': 'Heart of Darkness'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Ludhiana is a city and a municipal corporation in Ludhiana district in the Indian state of Punjab, and is the largest city north of Delhi. It is the largest city in the state, with an area of 310sq. km and an estimated population of 1,789,650 as of the 2015. The population increases substantially during the harvesting season due to the migration of labourers from the eastern states of Uttar Pradesh, Bihar, Odisha. The city stands on the Sutlej River's old bank, 13 km south of its present course. It is an industrial centre of northern India, and was referred to as India's Manchester by the BBC.", 'title': 'Ludhiana'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'First North Americans are a series of historical fiction novels published by Tor and written by husband and wife co-authors W. Michael Gear & Kathleen O\'Neal Gear. The series, which began with 1990\'s "People of the Wolf", explores various civilizations and cultures in prehistoric North America. It is comparable to Jean M. Auel\'s "Earth\'s Children" series, set in prehistoric Europe, but each of its books focuses on a different time period, location, and set of characters. The first four novels form a coherent, more or less linear narrative, from the initial migration of Siberian peoples into what is now Canada and Alaska (People of the Wolf) through the florescence of the Mississippian semi-urban mound-building culture, considered the "high-water mark" of North American pre-Columbian civilization, around 1000 AD. The remaining novels cover a wide variety of times and settings, in no particular order, ranging from tropical Florida in the 6th millennium BC to the Chaco Empire of the Southwest in the 13th century AD. The novels take into account new developments in North American archaeology such as the discovery of Kennewick Man and the development of the coastal-route model as a possible alternative or supplement to overland migration across Beringia.', 'title': 'First North Americans'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Waiting for Happiness (original title: Heremakono) is a 2002 drama film written and directed by Abderrahmane Sissako. Main characters are a student, who has returned to his home in Nouadhibou, an electrician and his child apprentice, and the local women. The film is characterized by a succession of scenes of the daily life of the characters which are unique to their particular African and Arab cultures, while borrowing from tropes of Tayeb Saleh's Season of Migration to the North (موسم الهجرة إلى الشمال). The viewer must interpret the scenes without much help from narrator or plot, while the structure of the film hangs on a series of mundane but visually arresting moments, many of which are repeated in other works in Abderrahmane Sissako's opus, including scenes at a barber shop and a photo booth, also present in his earlier La Vie Sur Terre and later Timbuktu. The film presents typical Mauritanian moments of beauty, struggle, alienation, and humor, which are experienced by groups socially divided from each other, such as Bidhan women drinking tea and gossiping, West African migrants passing through Mauritania to get to Europe (and finding an unsuccessful comrade washed ashore). The young protagonist who has returned interacts with all of these groups as an outsider, as he struggles to remember even his own Hassaniya Arabic dialect, but prefers instead French. Many of the themes and characters presage Sissako's 2014 film Timbuktu, and both explore liminal Sahel identities authentically situated in everyday life. Waiting for Happiness premiered at the 2002 Cannes Film Festival in the Un Certain Regard section.", 'title': 'Waiting for Happiness'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Ghorahi (Nepali: घोराही उपमहानगरपालिका) is the largest sub-metropolitan and seventh largest city of Nepal. The city (formerly Tribhuvannagar) lies in Province no 5 in Mid-Western part of Nepal . It is the largest city of Dang Deukhuri District of southwest Nepal. Located in the Inner Terai region, it lies 413 kilometres (257 mi) south-west of Nepal\'s capital Kathmandu and is one of the "Counter Magnets" being developed as an alternative centre of growth to help ease the migration and population explosion in the Kathmandu metropolitan area.It is the largest city of Rapti Region and is surrounded by the Sivalik in the south and Mahabharat range of Hills in the north.', 'title': 'Ghorahi'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Season of Migration to the North (Arabic: موسم الهجرة إلى الشمال\u200e \u200e Mawsim al-Hiǧra ilā ash-Shamāl ) is a classic post-colonial Sudanese novel by the novelist Tayeb Salih. Originally published in Arabic in 1966, it has since been translated into more than twenty languages. Salih was fluent in both English and Arabic, but chose to pen this novel in Arabic. The English translation was published in 1969 as part of the influential Heinemann African Writers Series. The novel is a counter narrative to "Heart of Darkness". It was described by Edward Said as one of the six great novels in Arabic literature. In 2001 it was selected by a panel of Arab writers and critics as the most important Arab novel of the twentieth century.', 'title': 'Season of Migration to the North'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Dehradun ( ) or Dehra Dun is the capital city of Uttarakhand, a state in the northern part of India. Located in the Garhwal region, it lies 236 km north of India\'s capital New Delhi and is one of the "Counter Magnets" of the National Capital Region (NCR) being developed as an alternative centre of growth to help ease the migration and population explosion in the Delhi metropolitan area and creation highways to establish a smart city at Dehradun.', 'title': 'Dehradun'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Lake Fehér is a lake of Hungary. It is named Fehér (White), because it is white. It is a part of Kiskunság National Park, and it is situated just north of the town of Szeged. It covers an area of 14 square kilometres. Lake Fehér is Hungary's largest saltwater lake. It is carefully protected because it is home to 280 species of bird and because of its ancient flora. The area is an important stop in the migration of European birds, and serves as a resting and feeding place for them. During the migration season, crowds of cranes, wild geese, and teal varieties are visible on Lake Fehér.", 'title': 'Lake Fehér (Szeged)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Tatsuhiro Ōshiro (大城 立裕 , Ōshiro Tatsuhiro , born 19 September 1925) is a Japanese novelist and playwright. He was awarded the Akutagawa Prize in 1967 for his novella of the same year, "The Cocktail Party", which has been adapted for the stage and made into a film. Ōshiro has also been an innovator of the traditional Ryukyuan narrative dance form known as kumi odori. Having added twenty new pieces to the repertoire, Ōshiro is credited as having "single-handedly revived the genre that originated in the 18th century" by incorporating Okinawa shibai (dramas in the Okinawan language) and distinctive rhythms to construct a fluid, hybrid cultural identity. His writings have been noted for making Okinawan culture and history accessible to Japanese readership, while his more popular works have been critically praised for "offering an acute perspective on the psychological and moral implications of war and military occupation."', 'title': 'Tatsuhiro Oshiro'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Haniel Clark Long (March 9, 1888 – October 17, 1956) was an American poet, novelist, publisher and academic. He is best known for his novella, "Interlinear to Cabeza de Vaca" (1936), a fictionalized account of the true story of a Spanish conquistador in 16th century North America.', 'title': 'Haniel Long'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Side Effects is a 2005 romantic comedy about the pharmaceutical industry, directed by Kathleen Slattery-Moschkau and starring Katherine Heigl as Karly Hert, a pharmaceutical "detailer", who becomes disillusioned with the lack of ethics in the pharmaceutical industry and has tough choices to make. The film also stars Lucian McAfee, Dorian DeMichele, Dave Durbin, Temeceka Harris. The film\'s title is a reference to the medical term "side effects".', 'title': 'Side Effects (2005 film)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'In modern medical English, the term typhus refers to a group of rickettsioses only. Some other groups of infectious diseases also have similar names:', 'title': 'Typhus (disambiguation)'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Ghostkeeper is a 1981 Canadian independent horror film directed by Jim Makichuk. The story centers on a trio of snowmobilers in the Canadian Rockies who become stranded at an abandoned hotel, where an old woman is hiding an evil entity within the basement. The film's plot is inspired by the Windigo legend of North America.", 'title': 'Ghostkeeper'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "In medicine, asthenization is a condition experienced by astronauts following long-term space flight, in which following return to Earth the astronaut experiences symptoms such as fatigue, irritability, lack of appetite, and sleep disorders. The condition's name derives from asthenia, which is a medical term denoting a feeling of weakness without actual loss of strength.", 'title': 'Asthenization'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Eileen Georgina "Georgie" Collins (née Given; June 12, 1925 – May 3, 2017) was a Canadian film, stage, and television actress. Collins is known for her role in the 1981 cult horror film "Ghostkeeper", as well as her part in "Lonesome Dove: The Series" (1995).', 'title': 'Georgie Collins'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Biocompatibility is related to the behavior of biomaterials in various contexts. The term refers to the ability of a material to perform with an appropriate host response in a specific situation. The ambiguity of the term reflects the ongoing development of insights into how biomaterials interact with the human body and eventually how those interactions determine the clinical success of a medical device (such as pacemaker, hip replacement or stent). Modern medical devices and prostheses are often made of more than one material so it might not always be sufficient to talk about the biocompatibility of a specific material.', 'title': 'Biocompatibility'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The legend lends its name to the controversial modern medical term Wendigo psychosis, described by psychiatrists as a culture-bound syndrome with symptoms such as an intense craving for human flesh and a fear of becoming a cannibal. In some Indigenous communities, environmental destruction and insatiable greed are also seen as a manifestation of Wendigo Psychosis.', 'title': 'Wendigo'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Causa Mortis is a satiric play by Jacob M. Appel that lampoons the modern medical establishment. The plot focuses on a woman, Eleanor, whose brain surgeon has accidentally left his watch in her skull. Her daughters urge her to have the timepiece extracted before it harms her, but every surgeon who attempts to remove it dies during the process. Critic Donald Calamia described the play as "a needle in the eyes of an industry that far-too often refuses to admit its human failings."', 'title': 'Causa Mortis'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'A microtiter plate (spelled Microtiter is a registered trade name in the United States) or microplate or microwell plate or multiwell, is a flat plate with multiple "wells" used as small test tubes. The microplate has become a standard tool in analytical research and clinical diagnostic testing laboratories. A very common usage is in the enzyme-linked immunosorbent assay (ELISA), the basis of most modern medical diagnostic testing in humans and animals.', 'title': 'Microtiter plate'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Syncopy Films Inc. is a British film production company based in London, England. The company was founded by film director, screenwriter and producer Christopher Nolan and his wife Emma Thomas. The name Syncopy Films derives from "syncope", the medical term for fainting or loss of consciousness.', 'title': 'Syncopy Inc.'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'H-63 is a county-designated highway (CDH) in the Upper Peninsula of the US state of Michigan. The highway parallels the Interstate 75 (I-75) corridor between St. Ignace and Sault Ste. Marie. The road is called Mackinac Trail after the Upper Peninsula branch of an Indian trail used before European settlers reached the area. Originally, the roadway was built as a section of US Highway 2 (US\xa02) before being added to the CDH system in the 1970s.', 'title': 'H-63 (Michigan county highway)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'U.S. Route 9 (US 9) is a U.S. highway in the northeast United States, running from Laurel, Delaware north to Champlain, New York. In New Jersey, the route runs 166.80 mi from the Cape May–Lewes Ferry terminal in North Cape May, Cape May County, where the ferry carries US 9 across the Delaware Bay to Lewes, Delaware, north to the George Washington Bridge in Fort Lee, Bergen County, where the route along with Interstate 95 (I-95) and US 1 continue into New York City. US 9 is the longest U.S. highway in the state. From North Cape May north to Toms River in Ocean County, US 9 is mostly a two-lane undivided road that closely parallels the Garden State Parkway and runs near the Jersey Shore. Along this stretch, it passes through the communities of Rio Grande, Cape May Court House, Somers Point, Pleasantville, Absecon, Tuckerton, Manahawkin, and Beachwood. In the Toms River area, US 9 runs along the Garden State Parkway for a short distance before heading northwest away from it and the Jersey Shore into Lakewood Township. Upon entering Monmouth County, the route transitions into a multilane suburban divided highway and continues through Howell Township, Freehold Township, Manalapan Township, Marlboro Township, Old Bridge Township, Sayreville, and South Amboy. In Woodbridge Township, US 9 merges with US 1 and the two routes continue through northern New Jersey as US 1/9 to the George Washington Bridge.', 'title': 'U.S. Route 9 in New Jersey'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Saginaw County, officially the County of Saginaw, is a county located in the U.S. state of Michigan. As of the 2010 census, the population was 200,169. The county seat is Saginaw. The county was created by September 10, 1822, and was fully organized on February 9, 1835. The etymology of the county\'s name is uncertain. It may be derived from "Sace-nong" or "Sak-e-nong" (English: Sauk land ), as the Sauk (French: "Sac" ) tribe once lived there. Another possibility is that it comes from Ojibwe words meaning "place of the outlet" –"sag" (English: an opening ) and "ong" (English: place of ). "See" List of Michigan county name etymologies.', 'title': 'Saginaw County, Michigan'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Sault Ste. Marie is a city in, and the county seat of, Chippewa County in the U.S. state of Michigan. It is situated on the northeastern end of Michigan's Upper Peninsula, on the Canada–US border, and separated from its twin city of Sault Ste. Marie, Ontario, by the St. Marys River. The city is relatively isolated from other communities in Michigan and is 346 miles from Detroit. The population was 14,144 at the 2010 census, making it the second most populous city in the Upper Peninsula. By contrast, the Canadian Sault Ste. Marie is much larger, with more than 75,000 residents, based on more extensive industry developed in the 20th century and an economy with closer connections to other communities.", 'title': 'Sault Ste. Marie, Michigan'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "County Road 492 (CR\xa0492, Co. Rd. 492) is a primary county road in Marquette County, Michigan. The road serves as an alternate route between Negaunee and Marquette. Several historic sites line the roadway as it runs south and parallel to the main highway, U.S. Highway 41 (US\xa041) and M-28, through the Marquette Iron Range in Michigan's Upper Peninsula. The path of the road runs near tracks of the Lake Superior and Ishpeming Railroad (LS&I). The locally created Iron Ore Heritage Trail will follow CR\xa0492 through Eagle Mills and Morgan Meadows upon completion. The western terminus of the county road is on US\xa041/M-28 in Negaunee and the eastern end is in Marquette next to Lake Superior.", 'title': 'County Road 492 (Marquette County, Michigan)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Lapeer is a city in the U.S. state of Michigan and is the county seat of Lapeer County. As of the 2010 census, the city population was 8,841. Most of the city was incorporated from land that was formerly in Lapeer Township, though portions were also annexed from Mayfield Township and Elba Township. The city government is politically independent of all three townships. Lapeer is in southern Michigan, east of Flint, on the Flint River. The name "Lapeer" is a corruption of the French "la pierre", which means "the flint". (See List of Michigan county name etymologies.)', 'title': 'Lapeer, Michigan'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'M-47 is a north–south state trunkline highway in the US state of Michigan. It runs near Saginaw and Midland in the Tri-Cities area of the Lower Peninsula. The highway runs through suburban and agricultural areas to connect the two cities with the airport in the area. The northernmost section of M-47 runs along a freeway to the terminus at US Highway 10 (US\xa010). M-47 runs for 14.328 mi , all of which has been listed as a part of the National Highway System.', 'title': 'M-47 (Michigan highway)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Highway 316 is a highway in the Canadian province of Saskatchewan. It runs from Highway 16 near Clavet to Highway 5. Highway 316 is about 17\xa0km (11\xa0mi.) long. This area is an industrial commercial area along Highway #316 which extends from Clavet north to the PCS Patience Lake Mine which is just 10 miles from the city of Saskatoon. Highway 316 is a primary weight highway, and also runs near the Canadian National Railway line which goes from Saskatoon through Clavet. In 1941, the Canadian Pacific Railway ran from Saskatoon through Cheviot and on south eastward.', 'title': 'Saskatchewan Highway 316'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Marginal Tietê (officially SP-015) is a section of this highway that runs through the city of São Paulo, Brazil. The name of this section comes from the fact that each way of the expressway runs near a different waterfront of the Tietê River. It is a very important road of São Paulo, connecting the East, North and West portions of the city, and linking the Lapa neighbourhood and the Penha neighbourhood. It provides access to the Castelo Branco highway, the Bandeirantes highway, the Anhangüera highway, the Presidente Dutra highway, the Fernão Dias highway, the Ayrton Senna highway and the São Paulo International Airport. The Campo de Marte Airport, the Estádio Parque São Jorge and the Estádio do Canindé are located near the freeway.', 'title': 'Marginal Tietê'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Manistee County is a county located in the U.S. state of Michigan. As of the 2010 census, the population was 24,733. The county seat is Manistee. The name "Manistee" is from an Ojibwe word first applied to the principal river of the county. The derivation is not certain, but it may be from "ministigweyaa", "river with islands at its mouth". "See also", List of Michigan county name etymologies and Kaministiquia River.', 'title': 'Manistee County, Michigan'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The List of Wells Fargo presidents includes those persons who have served as President of Wells Fargo since 1852. It includes the presidents of the express mail company from 1852 to 1918 and of the Wells Fargo Bank, which was separated from the express company in 1905 and merged with the Nevada National Bank to form the Wells Fargo Nevada National Bank - the lineal ancestor of the present Wells Fargo Bank.', 'title': 'List of Wells Fargo presidents'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Wells Fargo & Company is an American international banking and financial services holding company headquartered in San Francisco, California, with "hubquarters" throughout the country. It is the world\'s second-largest bank by market capitalization and the third largest bank in the U.S. by assets. In July 2015, Wells Fargo became the world\'s largest bank by market capitalization, edging past ICBC, before slipping behind JP Morgan Chase in September 2016, in the wake of a scandal involving the creation of over 2 million fake bank accounts by Wells Fargo employees. Wells Fargo surpassed Citigroup Inc. to become the third-largest U.S. bank by assets at the end of 2015. Wells Fargo is the second-largest bank in deposits, home mortgage servicing, and debit cards. The firm\'s primary U.S. operating subsidiary is national bank Wells Fargo Bank, N.A., which designates its main office as Sioux Falls, South Dakota.', 'title': 'Wells Fargo'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'John Gerard Stumpf (born September 15, 1953) is an American business executive and retail banker. He is the former chairman and chief executive officer of Wells Fargo, one of the Big Four banks of the United States. He was named CEO in June 2007, elected to the board of directors in June 2006, and named president in August 2005. He became chairman in January 2010. On October 12, 2016, Stumpf announced his retirement as chairman and CEO of effective immediately, following a scandal involving customer accounts and subsequent pressure from the public and lawmakers. He was succeeded by Timothy J. Sloan.', 'title': 'John Stumpf'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Timothy J. Sloan (born 1960/61) is an American banker. He is the chief executive officer (CEO) of Wells Fargo since October 2016, when he succeeded John Stumpf, having previously been chief operating officer (COO) and president.', 'title': 'Timothy J. Sloan'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Wells Fargo Rail is the new name for the historic First Union Rail Corporation, along with the combined business of the former GE Capital Rail Services, which Wells Fargo purchased from GE in September 2015. The new company/name took effect January 1, 2016, and is based in Rosemont, Illinois, USA. Wells Fargo Rail is the largest railcar and locomotive leasing company in North America with over 175,000 railcars and 1,800 locomotives available.', 'title': 'Wells Fargo Rail'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The Wells Fargo Building,formerly known as the Wells Fargo Bank Center, is a commercial and financial skyscraper in Augusta, Georgia, in the United States. After its completion, the building was the tallest building in Augusta from 1967 to 1976, when the Lamar Building surpassed it due to the completion of the penthouse. Today, it is the third tallest building in the city. The building's exterior surface is made completely in aluminum steel glass. At the time of its completion, the building was named the Georgia Railroad Bank & Trust. In 1989, the building's name was changed to the Wachovia Bank Center, making it the official headquarters of Wachovia in the eastern part of Georgia and the Central Savannah River Area. In 2008, the building's name was changed again to the Wells Fargo Building. It is now the official headquarters of Wells Fargo in the Augusta region.", 'title': 'Wells Fargo Building (Augusta)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The Wells Fargo Tower [formerly First National Bank Tower] is a skyscraper located on 506 Main Street in Las Cruces, New Mexico. It opened in 1962 and was originally planned to be only 7 stories tall. The final height of the tower is 120 ft and is 10 stories tall above ground, plus a basement floor below ground. Wells Fargo bought the building in 2001 and renamed it, after acquiring First National Bank's parent company. The building has 3 elevators (originally Otis, modernized by Dover); there are restrooms on every floor but the lobby and basement. The building is currently up for sale by its owner, Wells Fargo.", 'title': 'Wells Fargo Tower (Las Cruces)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Wells Fargo Tower, formerly known as the First Union Signet Tower, Wachovia Tower, and Union Trust Building, is a commercial high-rise in Baltimore, Maryland. The building rises 24 floors above street level and is 330 ft in height; it is tied with Charles Center South as the 17th-tallest building in the city. The structure was completed in 1985. The Wells Fargo Tower was developed by the Dallas-based Trammell Crow Company, and is currently owned by the Wells Fargo and Company. The structure is an example of modern architecture, and has a glass, steel and concrete façade. The Wachovia Tower rises from the site formerly occupied by the Calvert Building and 7-9 Saint Paul Street. The building, formerly housing offices for Wachovia, is now home to the regional office of Wells Fargo and Company.', 'title': 'Wachovia Tower (Baltimore)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Wachovia Securities was the trade name of Wachovia's retail brokerage and institutional capital markets and investment banking subsidiaries. Following Wachovia's merger with Wells Fargo and Company on December 31, 2008, the retail brokerage became Wells Fargo Advisors on May 1, 2009 and the institutional capital markets and investment banking group became Wells Fargo Securities on July 6, 2009.", 'title': 'Wachovia Securities'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Wells Fargo and Company Express Building was built "circa" 1877 in Silver Reef, Utah. It is one of three surviving structures in Silver Reef, which is now a ghost town. The building housed the offices of the Wells Fargo Company. The structure was built by local masons George Brooks and Ira McMullin of local red sandstone, with finished ashlar masonry by Brooks in the front and coursed rubble stone by McMullin on the other three sides. A parapet surrounds the single-slope roof on the front and sides. The main level is divided into two equal-sized rooms, each with two front entrances and a rear entrance, with a vault on one side. The basement does not connect to the upper levels. It was used as a stable. The Wells Fargo building was used as a mine supply store in the late 19th century, then for a time as the residence of the Colbath family. Its last use was as offices for the Western Gold and Uranium Company, who added a rear porch structure. The building is owned by Washington County.', 'title': 'Wells Fargo and Company Express Building'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Gay Power, Gay Politics" is a 1980 episode of the American documentary television series "CBS Reports". It was anchored by Harry Reasoner with reportage by George Crile. Crile also produced the episode with co-producer Grace Diekhaus. He conceived the show after becoming aware of the 1979 National March on Washington for Lesbian and Gay Rights and took as his focus the 1979 San Francisco mayoral election. After intermittent shooting over several months in 1979 with the cooperation of prominent members of the city\'s LGBT community, CBS aired "Gay Power, Gay Politics" on April 26, 1980.', 'title': 'Gay Power, Gay Politics'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 1995 San Francisco mayoral election was held on November 7, 1995, with a runoff election held on December 12, 1995. Former Speaker of the California State Assembly Willie Brown defeated incumbent mayor Frank Jordan in a runoff election to become the 41st Mayor of San Francisco.', 'title': 'San Francisco mayoral election, 1995'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Matthew Edward Gonzalez (born June 4, 1965) is an American politician, lawyer, and activist. He was an important figure in San Francisco politics in the years 2000–2005, when he served on San Francisco County's Board of Supervisors and was president of the Board. In 2003, Gonzalez, running as a member of the Green Party, lost a close race for mayor of San Francisco to Democrat Gavin Newsom. In the 2008 presidential election, Gonzalez ran for vice president as the running mate of candidate Ralph Nader. He currently works in San Francisco’s Public Defender's Office.", 'title': 'Matt Gonzalez'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The 2003 San Francisco mayoral election occurred on November 4, 2003. The incumbent, Willie Brown, was termed out of office and could not seek a third term. The general election included three top candidates including then Supervisor Gavin Newsom and then President of the Board of Supervisors, Matt Gonzalez and former Supervisor Angela Alioto. No candidate received the required majority so the race went into a run-off of the two top candidates, which were Gavin Newsom and Matt Gonzalez. The run-off occurred on December 9, 2003 where Gavin Newsom was elected mayor of San Francisco.', 'title': 'San Francisco mayoral election, 2003'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The 2011 San Francisco mayoral election was held on Tuesday, November 8, 2011, to elect the mayor of San Francisco. The incumbent, Ed Lee, succeeded in his bid to become the first elected Asian-American mayor of a major American city.', 'title': 'San Francisco mayoral election, 2011'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The 1999 San Francisco mayoral election was held on November 2, 1999, with a runoff election held on December 14, 1999. Incumbent mayor Willie Brown won reelection against supervisor and current Assemblyman Tom Ammiano and nine other candidates for a second term as Mayor of San Francisco.', 'title': 'San Francisco mayoral election, 1999'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The 2015 San Francisco mayoral election took place on November 3, 2015, to elect the Mayor of San Francisco, California.', 'title': 'San Francisco mayoral election, 2015'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The 1991 mayoral election was held to elect the 40th mayor of San Francisco. Frank Jordan defeated incumbent Art Agnos, Angela Alioto, Richard Hongisto, and Tom Hsieh to become the 40th mayor of San Francisco.', 'title': 'San Francisco mayoral election, 1991'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Chicken" John Rinaldi is a musician, showman, activist, and author living in San Francisco, California. He is involved with the San Francisco arts community as well as the Burning Man community. In what he referred to as "an experiment", he ran for Mayor in the 2007 San Francisco mayoral election, during which he wore fake mustaches, debated a puppet, and arranged costumed flash mobs to occur at campaign events, in an effort to be as flippant a candidate as possible.', 'title': 'Chicken John'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The 2007 San Francisco mayoral election occurred on November 6, 2007. Voters elected a Mayor of San Francisco and several local officials. Incumbent Mayor Gavin Newsom was re-elected by a good margin. There were 12 candidates on the ballot as well as 6 write-ins.', 'title': 'San Francisco mayoral election, 2007'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Linda Martín Alcoff (born July 25, 1955 in Panama) is a philosopher at the City University of New York who specializes in epistemology, feminism, race theory and existentialism. From 2012 to 2013, she served as president of the American Philosophical Association (APA), Eastern Division. Alcoff has called for greater inclusion of historically under represented groups in philosophy and notes that philosophers from these groups have created new fields of inquiry, including feminist philosophy, critical race theory, and LGBTQ philosophy. To help address these issues, with Paul Taylor and William Wilkerson, she started the Pluralist Guide to Philosophy. She earned her PhD in Philosophy from Brown University. She was recognized as the distinguished Woman Philosopher of 2005 by the Society for Women in Philosophy and the APA. She began teaching at Hunter College and the City University of New York Graduate Center in early 2009, after teaching for many years at Syracuse University.', 'title': 'Linda Martín Alcoff'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Ann Pettifor is a UK-based analyst of the global financial system, director of Policy Research in Macroeconomics (PRIME) a network of economists concerned with Keynesian monetary theory and policies; an honorary research fellow at the Political Economy Research Centre at City University, London (CITYPERC) and a fellow of the New Economics Foundation, London. She is Chair of the Goldsmiths College Political Economy Research Centre's Advisory Board. As executive director of the consultancy Advocacy International, Pettifor has advised governments and organisations on sovereign debt restructuring, international finance and sustainable development. She is a trustee of the PREP Foundation for Pluralist Economics.", 'title': 'Ann Pettifor'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Buddhist atomism is a school of atomistic Buddhist philosophy that flourished on the Indian subcontinent during two major periods . During the first phase, which began to develop prior to the 4th century BCE, Buddhist atomism had a very qualitative, Aristotelian-style atomic theory. This form of atomism identifies four kinds of atoms, corresponding to the standard elements. Each of these elements has a specific property, such as solidity or motion, and performs a specific function in mixtures, such as providing support or causing growth. Like the Hindus and Jains, the Buddhists were able to integrate a theory of atomism with their logical presuppositions.', 'title': 'Buddhist atomism'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Atomism or social atomism is a sociological theory arising from the scientific notion "atomic theory", coined by the ancient Greek philosopher Democritus and the Roman philosopher Lucretius. In the scientific rendering of the word, atomism refers to the notion that all matter in the universe is composed of basic indivisible components, or atoms. When placed into the field of sociology, atomism assigns the individual as the basic unit of analysis for all implications of social life. This theory refers to "the tendecy for society to be made up of a collection of self-interested and largely self-sufficient individuals, operating as separate atoms". Therefore, all social values, institutions, developments and procedures evolve entirely out of the interests and actions of the individuals who inhabit any particular society. The individual is the ‘atom’ of society and therefore the only true object of concern and analysis.', 'title': 'Atomism (social)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Leucippus ( ; Greek: Λεύκιππος , "Leúkippos"; fl. 5th cent. BCE) is reported in some ancient sources to have been a philosopher who was the earliest Greek to develop the theory of atomism—the idea that everything is composed entirely of various imperishable, indivisible elements called atoms. Leucippus often appears as the master to his pupil Democritus, a philosopher also touted as the originator of the atomic theory. However, a brief notice in Diogenes Laertius’s life of Epicurus says that on the testimony of Epicurus, Leucippus never existed. As the philosophical heir of Democritus, Epicurus\'s word has some weight, and indeed a controversy over this matter raged in German scholarship for many years at the close of the 19th century. Furthermore, in his "Corpus Democriteum", Thrasyllus of Alexandria, an astrologer and writer living under the emperor Tiberius (14–37 CE), compiled a list of writings on atomism that he attributed to Democritus to the exclusion of Leucippus. The present consensus among the world\'s historians of philosophy is that this Leucippus is historical. The matter must remain moot unless more information is forthcoming from the record.', 'title': 'Leucippus'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'A pluralist theory of truth is a theory of truth which posits that there may be more than one property that makes a proposition true.', 'title': 'Pluralist theories of truth'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'A political agenda is a list of subjects or problems to which government officials as well as individuals outside the government are paying serious attention at any given time. It is most often shaped by political and policy elites, but can also be influenced by non-governmental activist groups, private sector lobbyists, think tanks, courts, and world events. There are varying theories on who truly decides the political agenda including: pluralist theory, elitist theory, and institutional theory. Each have different basic assumptions.', 'title': 'Political agenda'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Robert Alan Dahl ( ; December 17, 1915 – February 5, 2014) was a political theorist and Sterling Professor of Political Science at Yale University. He established the pluralist theory of democracy—in which political outcomes are enacted through competitive, if unequal, interest groups—and introduced "polyarchy" as a descriptor of actual democratic governance. An originator of "empirical theory" and known for advancing behavioralist characterizations of political power, Dahl\'s research focused on the nature of decisionmaking in actual institutions, such as American cities. Dahl is considered one of the most influential political social scientists of the twentieth century, and has been described as "the dean of American political scientists."', 'title': 'Robert A. Dahl'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "The Pluralist school was a school of pre-Socratic philosophers who attempted to reconcile Parmenides' rejection of change with the apparently changing world of sense experience. The school consisted of Anaxagoras, Archelaus, and Empedocles. It can also be said to have included the Atomists, Leucippus and Democritus. The Pluralists rejected the idea that the diversity of nature can be reduced to a single principle (monism). Anaxagoras posited that nature contained an innumerable number of principles, while Empedocles reduced nature to four elements (fire, air, earth, and water) which could not be reduced to one another and which would be sufficient to explain change and diversity.", 'title': 'Pluralist school'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'In physics, horror vacui, or plenism, is commonly stated as "Nature abhors a vacuum." It is a postulate attributed to Aristotle, who articulated a belief, later criticized by the atomism of Epicurus and Lucretius, that nature contains no vacuums because the denser surrounding material continuum would immediately fill the rarity of an incipient void. He also argued against the void in a more abstract sense (as "separable"), for example, that by definition a void, itself, is nothing, and following Plato, nothing cannot rightly be said to exist. Furthermore, in so far as it would be featureless, it could neither be encountered by the senses, nor could its supposition lend additional explanatory power. Hero of Alexandria challenged the theory in the first century CE, but his attempts to create an artificial vacuum failed. The theory was debated in the context of 17th-century fluid mechanics, by Thomas Hobbes and Robert Boyle, among others, and through the early 18th century by Sir Isaac Newton and Gottfried Leibniz.', 'title': 'Horror vacui (physics)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The 2008 presidential campaign of John McCain, the longtime senior U.S. Senator from Arizona, was launched with an informal announcement on February 28, 2007 during a live taping of the "Late Show with David Letterman", and formally launched at an event on April 25, 2007. His second candidacy for the Presidency of the United States, he had previously run for his party\'s nomination in the 2000 primaries and was considered as a potential running mate for his party\'s nominee, then-Governor George W. Bush of Texas. After winning a majority of delegates in the Republican primaries of 2008, on August 29, leading up to the convention, McCain selected Governor Sarah Palin of Alaska as his running mate for Vice President. Five days later, at the 2008 Republican National Convention, McCain was formally selected as the Republican Party presidential nominee in the 2008 presidential election.', 'title': 'John McCain presidential campaign, 2008'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The United States presidential election of 1996 was the 53rd quadrennial presidential election. It was held on Tuesday, November 5, 1996. The Democratic national ticket was led by incumbent President Bill Clinton, and his running mate, incumbent Vice President Al Gore. The Republican nominee for President was Bob Dole, the former Republican Leader of the United States Senate and long-time Senator from Kansas who was previously the vice-presidential running mate of President Gerald Ford in 1976, following Vice President Nelson Rockefeller's retirement from politics that year. Dole's running mate for Vice President was Jack Kemp, a former NFL football player and the Housing Secretary under George H. W. Bush. Businessman Ross Perot ran as candidate for the Reform Party with economist Pat Choate as his running mate; he received less media attention and was excluded from the presidential debates and, while still obtaining substantial results for a third-party candidate, by U.S. standards, did not renew his success of the 1992 election. Turnout was registered at 49.0%, the lowest for a presidential election since 1924.", 'title': 'United States presidential election, 1996'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Mutilation Mix: Greatest Hits (That Never Were Hits) is a greatest hits album by the American hip hop group Insane Clown Posse. The album consists of excerpts of songs from the group's first three studio albums, as well as some rare, less well-known tracks. Dispersed throughout the music are several recordings of phone messages. The songs were hand picked by Insane Clown Posse. It is the 2nd compilation album and the 9th overall release by Insane Clown Posse.", 'title': 'Mutilation Mix'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Insane Clown President: Dispatches from the 2016 Circus is a non-fiction book by Matt Taibbi about Donald Trump and the 2016 United States presidential election. The book contains illustrations by "Rolling Stone" artist Victor Juhasz. Taibbi\'s choice of title for the book was motivated by Trump\'s marketing style. His work was inspired by Hunter S. Thompson, who had previously published "Fear and Loathing on the Campaign Trail \'72".', 'title': 'Insane Clown President'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Bizaar is the sixth studio album by Insane Clown Posse. Released on October 31, 2000, it is the first half of the "Bizaar Bizzar" double album, released the same day as its companion album, "Bizzar". It is the 14th overall release by Insane Clown Posse.', 'title': 'Bizaar'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The United States presidential election of 2016 was the 58th quadrennial American presidential election, held on Tuesday, November 8, 2016. In a surprise victory, the Republican ticket of businessman Donald Trump and Indiana Governor Mike Pence defeated the Democratic ticket of former First Lady, U.S. Senator of New York and Secretary of State Hillary Clinton and U.S. Senator from Virginia Tim Kaine. Trump took office as the 45th President, and Pence as the 48th Vice President, on January 20, 2017. Concurrent with the presidential election, Senate, House, and many gubernatorial and state and local elections were also held on November 8.', 'title': 'United States presidential election, 2016'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Mike Earl Clark is an American record producer and DJ from Detroit, Michigan. Clark is best known for his work with Insane Clown Posse, for which he has produced nine studio albums, and Kid Rock. Clark has produced solo material for Insane Clown Posse members Violent J and Shaggy 2 Dope, and contributed production to artists signed to the Psychopathic Records label founded by Insane Clown Posse.', 'title': 'Mike E. Clark'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Matthew C. "Matt" Taibbi ( ; born March 2, 1970) is an American author and journalist. Taibbi has reported on politics, media, finance, and sports, and has authored several books, including "Insane Clown President" (2017), "" (2014), "" (2010) and "The Great Derangement: A Terrifying True Story of War, Politics, and Religion" (2009).', 'title': 'Matt Taibbi'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Terror Wheel is the second EP by American hip hop group Insane Clown Posse, released on August 5, 1994 by Psychopathic Records. It is the second "sideshow" entry in the group\'s Dark Carnival saga. The EP contains six studio tracks. "The Dead Body Man" which was subsequently re-released in 1995 on Insane Clown Posse\'s third studio album "Riddle Box", in a slightly higher key. "The Dead Body Man" received significant local radio play in Detroit following the release of "The Terror Wheel". The song "The Smog" was originally known as "The Swarm", and was about a deadly swarm of insects. "The Smog" was also intended to be released on Riddle Box. The final track on the album contains a number you could call to find out the name of the next Joker\'s Card, "Riddle Box". It is the group\'s 4th overall release.', 'title': 'The Terror Wheel'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Behind the Paint is the 2003 autobiography of American hip hop artist Joseph Bruce, better known as Violent J, one half of the Detroit, Michigan hip hop group Insane Clown Posse. The book focuses on Bruce\'s entire life until 2002. It begins with a chronological account of his childhood, professional wrestling career, and musical career, including the conception of Insane Clown Posse\'s Dark Carnival mythology and the development of their fan base, known as "Juggalos".', 'title': 'Behind the Paint'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Panicum (panicgrass) is a large genus of about 450 species of grasses native throughout the tropical regions of the world, with a few species extending into the northern temperate zone. They are often large, annual or perennial grasses, growing to 1–3 m tall.', 'title': 'Panicum'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Panicum turgidum is an old world clumping desert bunchgrass of the "Panicum" genus. It is a plant of arid regions across Africa and Asia, and has been introduced to other parts of the world.', 'title': 'Panicum turgidum'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Populus Genome Integrative Explorer (PopGenIE) is an integrated set of tools for exploring the genome and transcriptome of the model plant system "Populus".', 'title': 'Popgenie'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Panicum capillare, known by the common name witchgrass, is a species of grass. It is native plant to most of North America from the East Coast through all of the West Coast and California. It can be found as an introduced species in Eurasia, and as a weed in gardens and landscaped areas. It grows in many types of habitat.', 'title': 'Panicum capillare'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Panicum mosaic virus" (PMV) is a positive-sense single-stranded RNA viral pathogen that infects plant species in the Panicoid tribe of the grass family "Poaceae". The pathogen was first identified in Kansas in 1953 and most commonly causes disease on select cultivars of turf grass, switchgrass, and millet. The disease most commonly associated with the panicum mosaic virus pathogen is St. Augustine Decline Syndrome, which infects species of turf grass and causes chlorotic mottling. In addition to St. Augustine Decline, panicum mosaic virus is responsible for chlorotic streaking and mild green mosaicking in select cultivars of switchgrass and millet.', 'title': 'Panicum mosaic virus'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Panicum mosaic satellite virus (SPMV) is a plant satellite virus. It only infects grasses which are infected by Panicum mosaic virus. One study found that 72% of "Stenotaphrum secundatum" (St Augustine grass) infected with panicum mosaic virus was also infected with SPMV. In addition to SPMV, many plants infected with panicum mosaic virus are also infected with satellite RNAs.', 'title': 'Panicum mosaic satellite virus'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Echinochloa crus-galli is a type of wild grass originating from tropical Asia that was formerly classified as a type of panicum grass. It is commonly known as cockspur (or cockspur grass), barnyard millet, Japanese millet, water grass, common barnyard grass, or simply "barnyard grass" (which may refer to any species of "Echinochloa" or the genus as a whole however). This plant can grow to 60" (1.5 m) in height and has long, flat leaves which are often purplish at the base. Most stems are upright, but some will spread out over the ground. Stems are flattened at the base. The seed heads are a distinctive feature, often purplish, with large millet-like seeds in crowded spikelets.', 'title': 'Echinochloa crus-galli'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Populus is a genus of 25–35 species of deciduous flowering plants in the family Salicaceae, native to most of the Northern Hemisphere. English names variously applied to different species include poplar , aspen, and cottonwood.', 'title': 'Populus'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 's of July 2014 the "World Checklist of Selected Plant Families" recognises about 450 accepted taxa (of species and infraspecific names) in the plant genus "Panicum".', 'title': 'List of Panicum species'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Panicum lycopodioides, common name false club-moss panic grass or (in French) panic faux-lycopode, is endemic to the French island of Réunion in the Indian Ocean. It is found at high altitudes on the island, at elevations over 2000 m (6700 feet). The highest point on the island is Piton des Neiges, 3069 m (10,230 feet). The plant requires full sun-light and a cold climate.', 'title': 'Panicum lycopodioides'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The term white savior, sometimes combined with savior complex to write white savior complex, refers to a white person who acts to help people of color, with the help in some contexts perceived to be self-serving. The role is considered a modern-day version of what is expressed in the poem "The White Man\'s Burden" (1899) by Rudyard Kipling. The term has been associated with Africa, and certain characters in film and television have been critiqued as white savior figures. Writer Teju Cole combined the term and "industrial complex" (derived from military-industrial complex and similarly applied elsewhere) to coin "White Savior Industrial Complex".', 'title': 'White savior'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Russell Alphonse Rulau (September 21, 1926 – November 12, 2012) was an American numismatist. He was involved in coin collecting for over 60 years. From his earliest days as a casual collector, Rulau contributed to numismatics as a writer, editor and club organizer. His interest in world coins led him to create the "Coin of the Year" award. The award is presented annually by Krause Publications\' "World Coin News". Rulau coined the term "exonumia" in 1960.', 'title': 'Russell Rulau'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The American Gold Eagle is an official gold bullion coin of the United States. Authorized under the Gold Bullion Coin Act of 1985, it was first released by the United States Mint in 1986. Because the term "eagle" also is the official United States designation for pre-1933 ten dollars gold coins, the weight of the bullion coin is typically used when describing American Gold Eagles (e.g., "1/2-ounce American Gold Eagle") to avoid confusion. This is particularly true with the 1/4-oz American Gold Eagle, which has a marked face value of ten dollars.', 'title': 'American Gold Eagle'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Dave U. Hall (born R.U.Hall? , in New York City) is an American musician whose musical voice is articulated by the tones of his Electric Bass guitar. He was a member of the band Birdland with Lester Bangs (Bangs, who is often cited today as "America\'s Greatest Rock Critic," was editor for Creem magazine, musician and staff writer for the Village Voice. His character was played in the movie "Almost Famous") and The Rattlers (in which Hall played on their acclaimed Rattled album and CD). He has also played with other bands (and artists) including, but not limited too, Zymosis, The Makers, Luigi & the Wiseguys, Danny Russo Blues Band (Muddy Waters, Willie Dixon, Victoria Spivey, Spivey Records), Remod (with Richie Ramone), Jeff Salen (Tuff Darts, Sparks (band)), Tiger Beats, Tina Peel, Joey Ramone, Saturday Night and Sunday Morning. By the end of the punk era, Hall had a reputation for being a session and performance player for many bands.', 'title': 'Dave U. Hall'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Sir Lord Baltimore was an American rock band from Brooklyn, New York, United States, formed in 1968 by lead vocalist/drummer John Garner, guitarist Louis Dambra, and bass player Gary Justin. Some have cited the 1971 review of their debut record, "Kingdom Come", in "Creem" magazine as containing the first documented use of the term "heavy metal" to refer to a style of music; the truth is the same reviewer used the term when reviewing a Humble Pie album in "Rolling Stone" six months earlier. Sir Lord Baltimore featured a drumming lead singer, traditionally a rarity in rock and metal music. The group have been called "the godfathers of stoner rock."', 'title': 'Sir Lord Baltimore'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Chorography (from χῶρος "khōros", "place" and γράφειν "graphein", "to write") is the art of describing or mapping a region or district, and by extension such a description or map. This term derives from the writings of the ancient geographer Pomponius Mela and Ptolemy, where it meant the geographical description of regions. However, its resonances of meaning have varied at different times. Richard Helgerson states that "chorography defines itself by opposition to chronicle. It is the genre devoted to place, and chronicle is the genre devoted to time". Darrell Rohl prefers a broad definition of "the representation of space or place".', 'title': 'Chorography'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Punk was a music magazine and fanzine created by cartoonist John Holmstrom, publisher Ged Dunn, and "resident punk" Legs McNeil in 1975. Its use of the term "punk rock", coined by writers for "Creem" magazine a few years earlier, further popularized the term. The founders were influenced by their affection for comic books and the music of The Stooges, the New York Dolls, and The Dictators. Holmstrom later called it "the print version of The Ramones". It was also the first publication to popularize the CBGB scene.', 'title': 'Punk (magazine)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Michael Earl "Mike" Saunders (born May 1952), also known as Metal Mike, is a rock critic and the singer of the Californian punk band Angry Samoans. He is credited with coining the music genre label "heavy metal" in a record review for Humble Pie\'s "As Safe As Yesterday Is" in the November 12, 1970 issue of "Rolling Stone." (The original text is shown in the VH1 Classic documentary "" from 2007.) Six months later in 1971, he used the phrase again while reviewing Sir Lord Baltimore\'s first album, "Kingdom Come", in the pages of "Creem" magazine.', 'title': 'Mike Saunders'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Creem (which is always capitalized in print as "CREEM" despite the magazine\'s nameplate appearing in mostly lower case letters), "America\'s Only Rock \'n\' Roll Magazine", was a monthly rock \'n\' roll publication first published in March 1969 by Barry Kramer and founding editor Tony Reay. It suspended production in 1989 but received a short-lived renaissance in the early 1990s as a glossy tabloid. Lester Bangs, often cited as "America\'s Greatest Rock Critic", became editor in 1971. The term "punk rock" was coined by the magazine in May 1971, in Dave Marsh\'s "Looney Tunes" column about Question Mark & the Mysterians.', 'title': 'Creem'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Gene Sculatti (born 1947/1948) is a music journalist who compiled and edited the book "The Catalog of Cool" (1982). In 1966, he became the first journalist to write about the nascent San Francisco music scene in a national magazine ("Crawdaddy! "). He is formerly an editorial director for Warner Bros. Records and the magazine "Billboard". He has also written for "Rolling Stone", "Creem", and "Radio & Records".', 'title': 'Gene Sculatti'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Eyes of Nye is a science program that aired on public television in the United States in 2005 and featured Bill Nye. The show was more sophisticated than its predecessor "Bill Nye the Science Guy", as it was aimed more toward adults and teenagers than children. All episodes were rated TV-G, except for "Addiction" and "The Evolution of Sex", both rated TV-PG. The creation of the show was motivated by the success of the television program "Bill Nye the Science Guy", as well as a widespread contempt among scientists for scientific journalism in the media. The program was based in Seattle, Washington, produced by Buena Vista Television and broadcast during primetime by KCTS, the local PBS affiliate.', 'title': 'The Eyes of Nye'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'First Air Flight 6560 was a charter flight which crashed near Resolute, Nunavut, Canada, on 20 August 2011. Of the 15 people on board, 12 were killed, and three were injured but survived. The aircraft involved a First Air passenger-cargo convertible (combi) Boeing 737-200, which was flying within Canada, from Yellowknife Airport, Northwest Territories, to Resolute Bay Airport, Nunavut. It crashed approximately 2 km east of the Resolute Bay Airport runway.', 'title': 'First Air Flight 6560'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Bill Nye the Science Guy is an American half-hour live action science program that originally aired from September 10, 1993 to June 20, 1998, and was hosted by Bill Nye. The show aired on PBS on October 10, 1994 to March 1, 1999 and was also syndicated to local stations.', 'title': 'Bill Nye the Science Guy'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Bradley Air Services Limited, operating as First Air, is an airline headquartered in Kanata, a suburb of Ottawa, Ontario, Canada. It operates services to 34 communities in Nunavut, Nunavik, and the Northwest Territories. The majority of its fleet is available for charters worldwide. First Air has assisted in various humanitarian missions such as the 2010 Haiti earthquake, airlifting relief supplies and equipment. Its main base, which includes a large hangar, cargo and maintenance facility, is located at Ottawa Macdonald–Cartier International Airport, with hubs at Iqaluit Airport, Rankin Inlet Airport and Yellowknife Airport.', 'title': 'First Air'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Air 500 Limited was a Canadian airline. Founded in 1985 by Dennis Chadala, former Captain, director of marketing and assistant to Carl Millard, of the defunct Millardair. The company commenced operations with 1 Super Beech 18 Model E, registered C-FTAE that was purchased from Bradley First Air where it had retired from flying the dew line in Northern Canada. The Beech18 was originally purchased new by Timmins Aviation. The founder had extensive knowledge of the emergency freight business and the operation of DC3s, Super DCs and DC4 aircraft due to his position within the inner circle at Millardair. Dennis Chadala created Air 500 Limited on a shoe string, without financing and was the first airline to receive licensing and an operating certificate at Toronto's Pearson International Airport following deregulation of the aviation industry in Canada in 1985. The airline grew rapidly adding an aircraft at the pace of 1 every six months. By 1989 it had acquired almost all of the business flying ad hock charter out of Toronto for Chrysler, Ford, GM and many others formerly serviced by his former place of employment at Millardair. The young owner's extensive knowledge of this niche area of aviation enabled him to expand rapidly and capture that market segment. At the time, Air 500 was an exceptional success story operating 3 Super Beech 18 aircraft, 2 Cessna 310s, 1 DC3, 1 Super DC(C117), 1 Piper Cheyenne and 1 Mitsubishi MU2 Marquise. In the early nineties, the fleet continued to grow adding 2 more Mitsubishi MU2 aircraft, 2 Citation 500 business jets and 1 Citation 2 business jet. In 1995 the airport was privatized and came under the direction and control of the GTAA (Greater Toronto Airport Authority) and Dennis Chadala simultaneously acquired Hangar #7, the newest hangar facility at the north end of the Pearson Airport off Derry Road with 40 years remaining on the current land lease. Air 500 had contracts in the courier industry, Air Ambulance Services and Aircraft Management as well as a base of operations at the Esso Avitat in Ottawa where 2 Mitsubishi Marquise MU2 aircraft were stationed. One was flying an exclusive long term contract for Nordion (formerly Atomic Energy of Canada) flying radio active isotopes to numerous destinations in the United States for medical purposes as a well a designated charter aircraft. Hangar #7 was large enough to lease out one half the facility to Air 500 Limited and the other half to Execaire/Innotech Aviation and they remained tenants of the hangar owned by Dennis Chadala until November 1998, at which time Execaire/Innotech owned by the IMP Group out of Halifax Nova Scotia struct a deal with Dennis Chadala to purchase his hangar facility, all his aircraft and the operating airline Air 500 Limited. Dennis Chadala stayed on with the company during a short transition period that ended in February 1999. Air 500 was amalgamated into Execaire and became part of that operating group taking advantage of the synergies available to them.", 'title': 'Air 500'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The following is a list of Australians who have attained air marshal rank within the Royal Australian Air Force (RAAF); that is, service personnel who have held the rank of air chief marshal (four-star rank), air marshal (three-star rank) or air vice marshal (two-star rank). The Royal Australian Air Force was established in 1921 as a separate branch of the Australian military forces. The service was modelled after the Royal Air Force—formed three years earlier—and adopted the same ranking system. Richard Williams, regarded as the "father" of the Royal Australian Air Force, was the service\'s first member to obtain air-officer rank on being promoted to air commodore (one-star rank) in 1927; he went on to become the first air vice marshal (1935) and air marshal (1940). In 1965, Sir Frederick Scherger became the first officer to be advanced to air chief marshal, one of only four members of the Royal Australian Air Force to obtain this rank as of June 2014. A further nineteen individuals have reached air marshal in the RAAF and 126 air vice marshal; seven officers have retired with the honorary rank of air vice marshal.', 'title': 'List of Royal Australian Air Force air marshals'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Air Vice-Marshal John Nmadu Yisa-Doko, GCON, CFR (born 1942) was Nigerian Air Force's Chief of the Air Staff from 1975 to 1980. Air Vice Marshal Yisa-Doko was appointed in July 1975, he was the first Air Vice Marshal and Indigenous Chief of Air Staff of the Nigerian Air Force . He retired in April 1980.", 'title': 'John Nmadu Yisa-Doko'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Henry Aloysius Petre, DSO, MC (12\xa0June 1884\xa0– 24\xa0April 1962) was an English solicitor who became Australia's first military aviator and a founding member of the Australian Flying Corps, predecessor of the Royal Australian Air Force. Born in Essex, he forsook his early legal career to pursue an interest in aviation, building his own aeroplane and gaining employment as a designer and pilot. In 1912, he answered the Australian Defence Department's call for pilots to form an aviation school, and was commissioned a lieutenant in the Australian Military Forces. The following year, he chose the site of the country's first air base at Point Cook, Victoria, and established its inaugural training institution, the Central Flying School, with Eric Harrison.", 'title': 'Henry Petre'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Stayce D. Harris is a United States Air Force Lieutenant General. She currently serves as the Assistant Vice Chief of Staff and Director, Air Staff, Headquarters, United States Air Force. She also serves as Deputy Chairman of the Air Force Council, and is the Air Force accreditation official for the international Corps of Air Attachés. Harris' promotion is a first for African-American females, as she is the first to hold the three-star rank in the Air Force. Additionally, she is the first Air Force Reservist to be promoted to the three-star rank other than the Commander, Air Force Reserve Command. Prior to her current assignment Harris was Commander, Twenty-Second Air Force.", 'title': 'Stayce Harris'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Maj. Gen. George G. Finch became the Senior Leader of the US Air National Guard; (Chief of the Air Division National Guard Bureau) (1948-1950) In June 1953 it was reported that Gen. Mark W. Clark would retire and be replaced by Maj. Gen George G. Finch on the UN command delegation to the Korean armistice talks George G. Finch, born April 11, 1902 in Dade City, Florida, is considered one of the pioneers in United States aviation history. He began his military career during World War 1, enlisting in the Aviation Section of the Army\'s Signal Corps in 1918. He remained in the Reserve Corps after the war, and in 1926, became Commander, 27th Pursuit Squadron, 1st Pursuit Group. In 1940, Georgia Governor Ed Rivers commissioned him to form the first flying unit of the Georgia Air National Guard. The unit was mobilized into the U.S. Army in September, 1941, with Major Finch as commander. After World War II, he was a leading critic of efforts to eliminate the air arm of the National Guard during peacetime. General Finch gained the respect and admiration of Air National Guardsmen throughout the nation with his steadfast support and successful efforts to preserve the Air Guard. He became the first Chief of the Air Force Division of the National Guard Bureau in 1948. Under his leadership, the Air National Guard built to combat readiness and was among the first components called into service after the outbreak of the Korean War. As a result of General Finch\'s vision and perseverance, 45,000 highly trained officers and airmen of 22 wings and 65 squadrons gave the Air Force the strength it needed in the early, critical phases of the Communist drive down the Korean peninsula.General Finch served as the senior Air Force member of the United Nations negotiating team at the peace talks at Panmunjom, Korea, and received the Legion of Merit for outstanding service in 1955; General Finch assumed command of Fourteenth Air Force, Robins AFB, Georgia, becoming the nation\'s first Air National Guardsman to head a numbered air force. General Finch had a career of "firsts" including the US Army\'s first night landing with a single, five-million-candlepower floodlight in 1927. He also established and endowed the General John P. McConnell Award at the United States Air Force Academy. Considered by many as the father of the strong, independent Air National Guard existing today, General Finch retired in 1957. No man has had greater impact on the Air Force Reserve and National Guard than has General George G. Finch.A graduate of the University of Georgia and a member of the Georgia Bar, General Finch was enshrined in the Georgia Aviation Hall of Fame May 18, 1996.', 'title': 'George G. Finch'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Caitlin Jean Stasey (born 1 May 1990) is an Australian actress. She is known for her role as Rachel Kinski in "Neighbours". Previously she played Francesca Thomas in "The Sleepover Club", although her breakthrough movie role came in "Tomorrow, When the War Began", a 2010 movie adaption of the teen novel of the same name in which she played lead protagonist Ellie Linton. She also played Lady Kenna in the American series "Reign" from 2013 to 2015 and had a recurring role in the ABC2 series "Please Like Me" from 2013 to 2016. In 2017 Stasey starred as Ada on the Fox television drama "APB", which was cancelled after one season in May 2017.', 'title': 'Caitlin Stasey'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Good In Bed is the debut novel of Jennifer Weiner. It tells the story of an overweight Jewish female journalist, her love and work life and her emotional abuse issues with her father. The novel was a "New York Times" Best Seller. Aspects of the plot were inspired by Weiner\'s own life.', 'title': 'Good in Bed'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'My Girlfriend\'s a Geek (腐女子彼女。 , Fujoshi Kanojo. ) is a Japanese light novel series in two volumes by Pentabu based on a popular blog of the same name with 11 million page views. A manga adaptation by Rize Shinba started serialization in 2007 and was published by Enterbrain under their "B\'s LOG Comics" imprint. A movie adaption was published in 2009 with "My Geeky Girlfriend" as the International English title. Both the light novel and manga have been licensed for release by Yen Press.', 'title': "My Girlfriend's a Geek"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'In Her Shoes (2002) is a work of Jewish American literature by Jennifer Weiner. It tells the story of two sisters and their estranged grandmother. The novel was a "New York Times" bestseller. The two sisters happen to wear the same size shoes - the only common ground that they have besides a mutual hatred of their step-mother.', 'title': 'In Her Shoes (novel)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Clint de Ganon is an American drummer and percussionist from Hastings, New York. Clint has played in many Broadway hits including Hairspray and Footloose - writing the drum score for both. He was also the drummer for the movie adaption of Hairspray. Currently, Clint can be found at the Stephen Sondheim Theatre where he is the drummer for Broadway musical .', 'title': 'Clint de Ganon'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Farhad Mann is a Canadian-American director, and screenwriter of film, television and commercials. He directed the feature film, "Fighting for Freedom", starring Kristanna Loken, Jose Maria Yazpik, Patricia De Leon, and Academy Award nominee and Emmy nominee, Bruce Dern. He also wrote and directed "" (1996) for New Line Cinema and his pilot "Max Headroom" (1987) ABC won several Emmy\'s. He directed the critically acclaimed TV movie adaption of Dean Koontz\'s best-selling novel, The Face of Fear, the Dean Koontz best-selling novel. The next pilot he directed, "Nick Knight", which became the long-running "Forever Knight", was picked up by CBS.', 'title': 'Farhad Mann'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Mansfield Park is a 1983 British television drama serial, made by the BBC, and adapted from Jane Austen's novel of the same name, originally published in 1814. The serial was the first screen adaptation of the novel. Contrary to Patricia Rozema's later movie adaption, it is faithful to Jane Austen's novel. Jonny Lee Miller, who has a small role as Charles Price in this serial, played Edmund Bertram in the aforementioned film version of the novel.", 'title': 'Mansfield Park (1983 TV serial)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Abraham Whistler is a fictional character in the Marvel Comics universe. He is a vampire hunter and the mentor of Blade. Screenwriter David S. Goyer created him for the 1998 film "Blade" (in which the part was played by Kris Kristofferson), but he first appeared on screen in "Spider-Man: The Animated Series" where he was voiced by Malcolm McDowell and later by Oliver Muirhead. In 2006, Abraham Whistler appeared in the television show "". He shares many traits and is partially inspired by the character Jamal Afari. His first appearance in a comic can be found in the comic book movie adaption of the Blade II movie, but his face is also seen on 2 covers of the Max imprint Blade comic from Marvel.', 'title': 'Abraham Whistler'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Jennifer Weiner (born March 28, 1970) is an American writer, television producer, and former journalist. She is based in Philadelphia, Pennsylvania. Her debut novel, published in 2001, was "Good in Bed". Her novel "In Her Shoes" (2002) was made into a movie starring Cameron Diaz, Toni Collette, and Shirley MacLaine.', 'title': 'Jennifer Weiner'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'In Her Shoes is a 2005 American comedy-drama film based on the novel of the same name by Jennifer Weiner. It is directed by Curtis Hanson with an adapted screenplay by Susannah Grant and stars Cameron Diaz, Toni Collette, and Shirley MacLaine. The film focuses on the relationship between two sisters and their grandmother.', 'title': 'In Her Shoes (film)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Robert Lesser or Bobby Lesser (born October 22, 1942) is an American actor born in New York City and now living in Santa Barbara, California. His earliest work dates back to 1967 with "David Holzman\'s Diary", directed by Jim McBride. His latest movies include the Japanese film "Best Wishes for Tomorrow" and post-production "Painting in the Rain". Lesser has worked with Bruce Willis, Ed Harris, Alan Arkin, Arnold Schwarzenegger, Matthew Broderick, Dennis Quaid, Penelope Ann Miller, and Richard Mulligan. He is well known in the Santa Barbara theater community.', 'title': 'Robert Lesser'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Dead Bang is a 1989 American action film directed by John Frankenheimer and starring Don Johnson. Johnson's character, based on real-life LASD Detective Jerry Beck, tracks the killer of a Los Angeles County Sheriff's Deputy and uncovers a plot involving hate literature, white supremacist militias and arms trafficking. The cast also includes Penelope Ann Miller, William Forsythe, Tim Reid, Bob Balaban, and Michael Jeter. Filmed in Calgary, Alberta.", 'title': 'Dead Bang'}
