 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The Shadow is a 1994 American superhero film from Universal Pictures, produced by Martin Bregman, Willi Bear, and Michael Scott Bregman, directed by Russell Mulcahy, that stars Alec Baldwin. The film co-stars John Lone, Penelope Ann Miller, Ian McKellen, Peter Boyle, Jonathan Winters, and Tim Curry. It is based on the pulp fiction character of the same name created by Walter B. Gibson in 1931.', 'title': 'The Shadow (1994 film)'}
