 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Penelope Ann Miller (born Penelope Andrea Miller; January 13, 1964), sometimes credited as Penelope Miller, is an American actress. She began her career on Broadway in the 1985 original production of "Biloxi Blues" and went on to receive a Tony Award nomination for the 1989 revival of "Our Town". She has starred in several major Hollywood films, particularly in the late 1980s and early 1990s, including "Adventures in Babysitting" (1987), "Biloxi Blues" (1988), "Big Top Pee-wee" (1988), "The Freshman" (1990), "Awakenings" (1990), "Kindergarten Cop" (1990), "Other People\'s Money" (1991), "Year of the Comet" (1992), and "Carlito\'s Way" (1993), for which she received a Golden Globe Award nomination. She returned to Broadway in the 1995 original stage production of "On the Waterfront". Her other films include a starring role in "The Relic" (1997) and supporting roles in "Chaplin" (1992), "Along Came a Spider" (2001) and "The Artist" (2011).', 'title': 'Penelope Ann Miller'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Sir Ian Murray McKellen, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (born 25 May 1939) is an English actor. He is the recipient of six Laurence Olivier Awards, a Tony Award, a Golden Globe Award, a Screen Actors Guild Award, a BIF Award, two Saturn Awards, four Drama Desk Awards, and two Critics\' Choice Awards. He has also received two Oscar nominations, four BAFTA nominations and five Emmy Award nominations.', 'title': 'Ian McKellen'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Tim Schlattmann is a three-time Emmy award nominee. Nebraska born and raised, this former disc jockey and college professor\'s writing credits include ABC\'s number one hit "Roseanne", Fox\'s "Get Real", the WB\'s "Smallville", the feature "", and most recently critically acclaimed "Dexter" for Showtime. In 2007, he garnered two Writers Guild of America award nominations: one for best dramatic series and an individual nod for his episode of "Dexter" entitled "The Dark Defender". That same year, "Dexter" was also nominated for an Emmy and Golden Globe in the best dramatic series category and received the prestigious Peabody Award. The following year, the "Dexter" writing staff was once again nominated in the best dramatic series category by the Writers Guild of America and the show was again nominated for an Emmy for best dramatic series, earning Tim his first Emmy nomination as a producer. 2009 and 2010 brought Tim and the "Dexter" writing staff Writers Guild of America, Emmy and Golden Globe nominations once again, and 2011 saw another Emmy nomination for "Dexter" in the best dramatic series category. As an Executive Producer since 2012, Tim Schlattmann recently completed the eighth and final season of "Dexter" and authored "", an ongoing web series for Showtime. He has currently served as an Executive Producer on CBS\'s "Under The Dome".', 'title': 'Tim Schlattmann'}]

