 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The BBC News at One is the afternoon/lunchtime news bulletin from the BBC. Produced by BBC News, the programme is broadcast on BBC One and the BBC News channel every weekday at 1:00pm. The programme is usually presented by Sophie Raworth every Monday to Thursday and Kate Silverton on Friday.', 'title': 'BBC News at One'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Estate Jewelry (or jewellery) is a term used, most commonly in a retail sense, to refer to jewelry and often timepieces which are part of the ‘estate’ of a deceased person. More correctly estate jewelry is second-hand or pre-owned jewelry, with the ‘estate’ appellation signifying that the item is antique, vintage or an otherwise considered a significant or important piece.', 'title': 'Estate jewelry'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Snowboarding is a sport at the Winter Olympic Games. It was first included in the 1998 Winter Olympics in Nagano, Japan. Snowboarding was one of five new sports or disciplines added to the Winter Olympic program between 1992 and 2002, and was the only one not to have been a previous medal or demonstration event. In 1998, four events, two for men and two for women, were held in two specialities: the giant slalom, a downhill event similar to giant slalom skiing; and the half-pipe, in which competitors perform tricks while going from one side of a semi-circular ditch to the other. Canadian Ross Rebagliati won the men's giant slalom and became the first athlete to win a gold medal in snowboarding. Rebagliati was briefly stripped of his medal by the International Olympic Committee (IOC) after testing positive for marijuana. However, the IOC's decision was reverted following an appeal from the Canadian Olympic Association. For the 2002 Winter Olympics, giant slalom was expanded to add head-to-head racing and was renamed parallel giant slalom. In 2006, a third event, the snowboard cross, was held for the first time. In this event, competitors race against each other down a course with jumps, beams and other obstacles. On July 11, 2011, the International Olympic Committee's Executive Board approved the addition of Ski and Snowboard Slopestyle to the Winter Olympics roster of events, effective in 2014. The decision was announced via press conference from the IOC's meeting in Durban, South Africa. A fifth event, parallel slalom, was added be in 2014.", 'title': 'Snowboarding at the Winter Olympics'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Snowkiting or Kite skiing is an outdoor winter sport where people use kite power to glide on snow or ice. The skier uses a kite to give them power over large jumps. The sport is similar to water-based kiteboarding, but with the footwear used in snowboarding or skiing. The principes of using the kite is the same, but in different terrain. In the early days of snowkiting, foil kites were the most common type; nowadays many kiteboarders use inflatable kites. However, since 2013, newly developed racing foil kites seem to dominate speed races and expedition races, like Red Bull Ragnarok (held on the Norwegian Hardangervidda plateau) and the Vake mini-expedition race (held at Norway's most northern Varanger peninsula). Snowkiting differs from other alpine sports in that it is possible for the snowkiter to travel uphill and downhill with any wind direction. Like kiteboarding, snowkiting can be very hazardous and should be learned and practiced with care. Snowkiting is becoming increasingly popular in places often associated with skiing and snowboarding, such as Russia, Canada, Iceland, France, Switzerland, Austria, Norway, Sweden and the Northern and Central United States. The sport is becoming more diverse as adventurers use kites to travel great distances and sports enthusiasts push the boundaries of freestyle, big air, speed and back country exploration.", 'title': 'Snowkiting'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The Salzkammergut is a resort area located in Austria. It stretches from the City of Salzburg eastwards along the Austrian Alpine Foreland and the Northern Limestone Alps to the peaks of the Dachstein Mountains, spanning the federal states of Upper Austria, Salzburg, and Styria. The main river of the region is the Traun, a right tributary of the Danube. The name "Salzkammergut" literally means "Estate of the Salt Chamber" and derives from the Imperial Salt Chamber, the authority charged with running the precious salt mines of the Habsburg Monarchy. It is a UNESCO World Heritage Site.', 'title': 'Salzkammergut'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Aspen Snowmass is a winter resort complex located in Pitkin County in western Colorado in the United States. Owned and operated by the Aspen Skiing Company it comprises four skiing/snowboarding areas on four adjacent mountains in the vicinity of the towns of Aspen and Snowmass Village. The four areas collectively form one of the most famous winter resorts in the world and are annually the destination for visitors from all over the world.', 'title': 'Aspen/Snowmass'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Crystal Mountain Resort was a small day-use ski area near West Kelowna, British Columbia, Canada. It has two chairlifts and one surface lift: a GMD Mueller doublechair, a Leitner-Poma triplechair, and a Doppelmayr T-bar. The ski area has 30 designated groomed runs and the resort also has many different tree trails and some glades. Despite the smaller size of the resort, which is considerably smaller than neighbouring resorts such as Big White Ski Resort and Silver Star Mountain Resort, the mountain is of good size and is a popular destination for both experienced and first-time skiers, snowboarders and snowshoers. Despite the lower elevation, the resort receives heavy snowfall each year with many powder days throughout the winter season. It was long known as Last Mountain Ski Resort but has since changed its name to Crystal Mountain Resort in 1992. Crystal Mountain Resort offers lessons for skiing and snowboarding as well as offering rentals for snowshoeing. It has not been in operation since 2014 due to a lift malfunction of the Blue doublechair.', 'title': 'Crystal Mountain (British Columbia)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Bromley Mountain is located in southern Vermont, United States and is part of the Green Mountains. It is located in Bennington County, seven miles (11\xa0km) east of Manchester, Vermont and just west of Peru, Vermont. It is a popular destination for skiing and snowboarding.', 'title': 'Bromley Mountain'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Obertraun, Upper Austria is a village in the Salzkammergut, a region in Austria. It is located near the Hallstätter See (Hallstatt Lake) and Hoher Dachstein. Obertraun is a popular holiday destination offering activities such as skiing, snowboarding in the winter and mountain biking, swimming and kayaking in the summer.', 'title': 'Obertraun'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Snowboarding is a sport that has been contested at the Winter Olympic Games since the 1998 Winter Olympics in Nagano, Japan. Snowboarding was one of five new sports or disciplines added to the Winter Olympic programme between 1992 and 2002, and was the only one not to have been a previous medal or demonstration event. In 1998, four events, two for men and two for women, were held in two specialities: the giant slalom, a downhill event similar to giant slalom skiing; and the half-pipe, in which competitors perform tricks while going from one side of a semi-circular ditch to the other. Canadian Ross Rebagliati won the men's giant slalom and became the first athlete to win a gold medal in snowboarding. Rebagliati was briefly stripped of his medal by the International Olympic Committee (IOC) after testing positive for marijuana. However, the IOC's decision was reverted following an appeal from the Canadian Olympic Association. For the 2002 Winter Olympics, the giant slalom was dropped in favour of the parallel giant slalom, an event that involves head-to-head racing. In 2006, a third event, the snowboard cross, was held for the first time. In this event, competitors race against each other down a course with jumps, beams and other obstacles.", 'title': 'List of Olympic medalists in snowboarding'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Front Range is a mountain range of the Southern Rocky Mountains of North America located in the central portion of the U.S. State of Colorado, and southeastern portion of the U.S. State of Wyoming. It is the first mountain range encountered moving west along the 40th parallel north across the Great Plains of North America. The Front Range runs north-south between Casper, Wyoming and Pueblo, Colorado and rises nearly 10,000 feet above the Great Plains. Longs Peak, Mount Evans, and Pikes Peak are its most prominent peaks, visible from the Interstate 25 corridor. The area is a popular destination for mountain biking, hiking, climbing, and camping during the warmer months and for skiing and snowboarding during winter. Millions of years ago the present-day Front Range was home to ancient mountain ranges, deserts, beaches, and even oceans.', 'title': 'Front Range'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The 4\xa0×\xa0100\xa0metres relay or sprint relay is an athletics track event run in lanes over one lap of the track with four runners completing 100\xa0metres each. The first runners must begin in the same stagger as for the individual 400\xa0m race. A relay baton is carried by each runner and must be passed within a 20\xa0m changeover box (usually marked by yellow lines) which extends 10\xa0m on either side of each 100\xa0m mark of the race. Another line is marked 10\xa0m farther back, marking the earliest point at which the outgoing runner may begin (giving up to 10\xa0m of acceleration before entering the passing zone).', 'title': '4 × 100 metres relay'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Daniel da Silva Carvalho (born 1 March 1983 in Jaguarão, Rio Grande do Sul), more commonly known as Daniel Carvalho, is a Brazilian football attacking midfielder for Goiás.', 'title': 'Daniel Carvalho'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The 4\xa0×\xa0400\xa0metres relay or long relay is an athletics track event in which teams consist of four runners who each complete 400\xa0metres or one lap. It is traditionally the final event of a track meet. At top class events, the first 500\xa0metres is run in lanes. Start lines are thus staggered over a greater distance than in an individual 400\xa0metres race; the runners then typically move to the inside of the track.', 'title': '4 × 400 metres relay'}
