 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Lucas da Silva Carvalho (born 16 July 1993) is a Brazilian sprinter specialising in the 400 metres. He represented his country at the 2017 World Championships without qualifying for the semifinals. He was also an unused reserve runner for the Brazilian 4 × 400 metres relay at the 2016 Summer Olympics.', 'title': 'Lucas Carvalho'}
