 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Marisa Letícia Lula da Silva (née Rocco Casa; São Bernardo do Campo, 7 April 1950 – São Paulo, 3 February 2017) was the second wife of former President of Brazil, Luiz Inácio Lula da Silva, and First Lady of Brazil from 2003 to 2010. Lula's first wife, Maria de Lourdes da Silva, died in labour when Lula was in his twenties. And Marisa'a first spouse, Marcos Cláudio da Silva, died in 1971. On January 24, 2017 Marisa Letícia suffered a stroke. She died on February 3, 10 days later at the age of 66 in Sírio-Libanês Hospital. President Michel Temer declared three days of official mourning. She was cremated the next day. Her ashes were interred in the Cemitério Jardim da Colina, in her native São Bernardo do Campo, São Paulo.", 'title': 'Marisa Letícia Lula da Silva'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Jheimy da Silva Carvalho (Jacundá, August 6, 1988), is a Brazilian footballer who acts as a striker. Currently plays for Oeste on loan from Atlético Mineiro.', 'title': 'Jheimy'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Artur Zaczek (born 28 February 1989) is a Polish athlete specialising in the sprinting events. He won a bronze medal in the 4 × 100 metres relay at the 2009 European U23 Championships in addition to three medals won in the same event at the Summer Universiades between 2009 and 2015. He was also an unused reserve runner at the 2012 Summer Olympics, as well as the 2011 and 2013 World Championships.', 'title': 'Artur Zaczek'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Jeremy Harris (born December 7, 1950) is an American politician who served as Mayor of Honolulu from 1994 to 2004. A biologist by training, Harris started his political career as a delegate to the 1978 Hawai\'i State Constitutional Convention. As chief executive of the City & County of Honolulu, the city was named "America\'s Greatest City" by the official American governance journal, "Governing Magazine". Harris is the founder of the "China-U.S. Conference of Mayors and Business Leaders" and "Japan-American Conference of Mayors and Chamber of Commerce Presidents". He is married to Ramona Sachiko Akui Harris and lives in Kalihi Valley on the Island of O\'ahu.', 'title': 'Jeremy Harris'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Hyattsville Armory is a historic National Guard armory built in 1918 and located in Hyattsville, Prince George's County, Maryland, United States. It was the first Armory built in Prince George's County and the fifth in Maryland. Its architect, Robert Lawrence Harris, served as State Architect under Governor Albert C. Ritchie. In this capacity, Harris supervised the design of similar armories in Salisbury, Kensington, Silver Spring, Hagerstown, Laurel, Easton, Crisfield, Pocomoke City, Centreville, and Cumberland. The structure is distinctly fortresslike and offers a commanding view of the surrounding area. The building is patterned after a medieval English castle and built of native stone, with rectangular turrets flanking the arched limestone entranceway. Carved above the entry is the State Seal of Maryland.", 'title': 'Hyattsville Armory'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Robert George Mallaby Carter (born 11 July 1937), known as Bob, is a former English cricketer who played first-class and List A cricket for Worcestershire. He was capped by the county in 1965, and was awarded a benefit season in 1973, which raised about £7,000. All but two of his 523 first-class wickets came for Worcestershire; the others were obtained for MCC in the very last game of his career. Carter’s batting was generally extremely poor, as evidenced by his career batting average of under five in both forms of the game, although he did play one significant – if ultimately fruitless – innings. In the 1963 Gillette Cup final against Sussex at Lord's, he came to the wicket with Worcestershire 133/9, needing 35 runs to win. In fading light, he and wicket-keeper Roy Booth added 21 before Carter was run out to end the match. Carter also played in a critical close finish the following season against Nottinghamshire, where he and Flavell managed to get home by a single wicket and virtually seal the county’s first Championship title.", 'title': 'Bob Carter (cricketer, born 1937)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Cedartown is a city in Polk County, Georgia, United States. As of the 2010 census, the city had a population of 9,750. The city is the county seat of Polk County. Cedartown is the principal city of and is included in the Cedartown, Georgia Micropolitan Statistical Area, which is included in the Atlanta-Sandy Springs-Gainesville, Georgia-Alabama (part) Combined Statistical Area.', 'title': 'Cedartown, Georgia'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Rodney Glenn Ellis (born April 7, 1954) is an American politician. He represented Texas' 13th state senate district in the Texas Senate from 1990 to 2017. The district contains portions of Harris County, including downtown Houston, and Fort Bend County. He is a member of the Democratic Party. On June 25, 2016, Ellis won the Democratic Party's nomination for Harris County Commissioners Court Precinct 1. He was elected county commissioner on November 8, 2016 and sworn into office on January 1, 2017.", 'title': 'Rodney Ellis'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'James Alexander Russell Harris (born 16 May 1990) is a Welsh professional cricketer who is on the staff of Middlesex County Cricket Club. Harris is a right arm fast bowler and right-handed batsman. He was born in Morriston near Swansea in South Wales and played for Glamorgan as a teenager. On 4 April 2017 Harris joined Kent on loan for the first part of the 2017 season.', 'title': 'James Harris (cricketer, born 1990)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Elmer Frank Harris (born November 1939 in Seal Cove, Conception Bay Newfoundland), is a noted Canadian humanitarian.', 'title': 'Elmer Frank Harris'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Michael P. Fleming (born June 25, 1963 in Orlando, Florida) is a Houston, Texas based attorney and former elected official. Fleming is board certified in Personal Injury Law by the Texas Board of Legal Specialization. Fleming is the managing partner of Michael P. Fleming & Associates, P.C. Fleming was elected as county attorney in Harris County, Texas in 1996 and reelected the following term in 2000. Fleming was the lead attorney for Harris County before the Supreme Court of the United States in the case Christensen v. Harris County, a case that defined the limits of the Fair Labor and Standards Act and the authority of opinion letters issued by Department of Labor. Fleming comes from a family with several generations of politicians. His grandfather was Harry Raymond Fleming and great-grandfather was George William Kyte. His wife is the elected Judge of Harris County Criminal Court at Law Number 3. Michael Fleming and his wife, Judge Natalie Fleming, have six children and reside in Houston.', 'title': 'Michael P. Fleming'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Seale Harris (March 13, 1870 – March 17, 1957) was an American physician and researcher born in Cedartown, Georgia. He was nicknamed "the Benjamin Franklin of Medicine" by contemporaries for his leadership and writing on a wide range of medical and political topics. Dr. Harris\' most celebrated accomplishments were his 1924 hypothesis of hyperinsulinism as a cause of spontaneous hypoglycemia.', 'title': 'Seale Harris'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Gregory Scott Glasson (born December 6, 1974) is an American bass player. He has played bass for Grammy Award winning artist Seal both live onstage and in studio recordings. Glasson is also widely known as a solid session player, and has been featured on numerous albums, for a variety of artists. Mostly sought after in the Pop rock field, Glasson has played on major label tracks for artists such as Seal, Alanis Morissette and producer Josh Harris.', 'title': 'Gregory S. Glasson'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Final Fight Revenge (Japanese: ファイナルファイト リベンジ , Hepburn: Fainaru Faito Ribenji ) is a 1999 American-developed 3D fighting video game. The game was produced by the American division of Capcom (later known as "Capcom Production Studio 8"), which later produced "" and "". "Final Fight Revenge" was released for the arcades on July 1999 and ran on the Sega ST-V arcade hardware. It is the only "Final Fight" sequel released for the arcades. A home version was released for the Sega Saturn on March 30, 2000, which was the last Capcom game officially released for the platform. The Sega Saturn version was only available in Japan. However, the game can be played in English if the console\'s internal language is set to English.', 'title': 'Final Fight Revenge'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Short Circuit is a 1986 American comic science fiction film directed by John Badham and written by S. S. Wilson and Brent Maddock. The film\'s plot centers upon an experimental military robot that is struck by lightning and gains a more humanlike intelligence, with which it embarks to explore its new state. "Short Circuit" stars Ally Sheedy, Steve Guttenberg, Fisher Stevens, Austin Pendleton and G. W. Bailey, with Tim Blaney as the voice of the robot named "Johnny 5". A sequel, "Short Circuit 2", was released in 1988.', 'title': 'Short Circuit (1986 film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Short Circuit 2 is a 1988 American science fiction comedy film, the sequel to the 1986 film "Short Circuit". It was directed by Kenneth Johnson, and starred Fisher Stevens as Ben Jahveri, Michael McKean as Fred Ritter, Cynthia Gibb as Sandy Banatoni, and Tim Blaney as the voice of Johnny 5 (the main character – a friendly, naive, self-aware robot). Filming took place in downtown Toronto, Ontario, Canada.', 'title': 'Short Circuit 2'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Shaggy Dog is a 2006 American family comedy film directed by Brian Robbins and written by Geoff Rodkey, Jack Amiel, Michael Begler, Cormac Wibberley and Marianne Wibberley. It is the second remake of the 1959 film of the same name, which was first remade as a television film in 1994. Both the 1959 and 1994 features, as well as the 1976 theatrical sequel and the 1987 television sequel, had a character named Wilby Daniels transforming into an Old English Sheepdog, whereas this remake presents a character named Dave Douglas transforming into a Bearded Collie. It stars Tim Allen, Robert Downey, Jr., Kristin Davis, Danny Glover, Spencer Breslin, Jane Curtin, Zena Grey and Philip Baker Hall.', 'title': 'The Shaggy Dog (2006 film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Nessuno mi può giudicare (meaning: "Nobody can judge me") is a 1966 Italian musicarello film directed by Ettore Maria Fizzarotti. It is named after the Caterina Caselli\'s hit song "Nessuno mi può giudicare". It had a sequel released the same year, "Perdono".', 'title': 'Nessuno mi può giudicare (1966 film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Penny Racers is a racing game for the Nintendo 64. It was released in Japan in 1998, and in North America and Europe one year later. The game is part of the Japanese racing game series "Choro Q" and is known by the name Choro Q 64 in Japan. (Japanese title: チョロＱ64). The game had a Nintendo 64 sequel released only in Japan, "". It is a customizable racer game, it has a total of 114 Parts, arranged in eight categories.', 'title': 'Penny Racers (1998 video game)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Nyoka the Jungle Girl is a fictional character created for the screen in the 1941 serial "Jungle Girl", starring Frances Gifford as Nyoka Meredith. The character of Nyoka is often described as having been created by Edgar Rice Burroughs; however, although the serial was officially based on Burroughs\' story "Jungle Girl" (first appearing in the pulp magazine, "Blue Book", and later published as a novel), there is no character named Nyoka and no Nyoka-like character in the original story. The movie\'s credits list Burroughs along with six other writers, but his input on creating the film character was obviously minimal, because the studio later was able to use the name "Nyoka" in a sequel without crediting Burroughs at all. After the initial film, Nyoka appeared in comic books published by Fawcett, Charlton, and AC Comics.', 'title': 'Nyoka the Jungle Girl'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Mage Gauntlet is an iOS game developed by Rocketcat Games and released on October 20, 2011. In this game you follow the main character named Lexi, in an adventure around the continent in search of a way to defeat the demon Lord Hurgoroth, and prevent him from taking over the world.', 'title': 'Mage Gauntlet'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Where\'s Herb? was an advertising campaign for the fast food chain Burger King in 1985 and 1986. The television commercials featured a fictional character named Herb, who was described as never having eaten a Burger King burger in his life. They called on fans to visit their local Burger King in the hope of finding Herb and winning a prize. The campaign also included an "I\'m not Herb" promotion, in which customers could get a discounted Whopper by including the phrase in their order. This confused people who tried to follow the promotion because they did not know what Herb looked like. By the time his appearance was revealed, many people had already lost interest in the campaign. The promotion was poorly received and was the last campaign that the J. Walter Thompson firm was hired to design for Burger King.', 'title': "Where's Herb?"}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Lawrence Turman (born November 28, 1926 in Los Angeles) is a film producer who currently serves as the director of The Peter Stark Producing Program at the University of Southern California. He was nominated for an Academy Award for "The Graduate" (1967). He has also produced such films such as "Pretty Poison" (1968), "The Great White Hope" (1970), "The Thing" (1982), "Mass Appeal" (1984), "Short Circuit" (1986), "The River Wild" (1994), and "American History X" (1998).', 'title': 'Lawrence Turman'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Anthony "Pacer" Edwards (1962 – 18 February 2014) was a Bermudian cricketer who represented the Bermudian national team from 1983 to 1994. He played for Bermuda at the 1986, 1990, and 1994 ICC Trophies.', 'title': 'Pacer Edwards'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Celestyal Crystal, previously Louis Cristal, is a cruise ship operated by the Cyprus-based Celestyal Cruises and previously Louis Cruise Lines, both in the Louis Group. The ship was originally built as the cruiseferry MS "Viking Saga in 1980 at Wärtsilä Turku New Shipyard, Turku, Finland for Rederi Ab Sally. In 1986 she was renamed MS "Sally Albatross, and rebuilt into a cruise ship the following year. The ship was destroyed by a fire in 1990, and completely rebuilt at Finnyards, Rauma, Finland. She was re-delivered in 1992, still named "Sally Albatross". After partially sinking 1994 she was rebuilt at Industrie Navali Maccaniche Affini, La Spezia, Italy, re-entering service as MS "Leeward for Norwegian Cruise Line. Subsequently she sailed as MS "SuperStar Taurus for Star Cruises, MS "Silja Opera for Silja Line and spent a year laid up as MS "Opera prior to entering service with her current owner in 2007.', 'title': 'Celestyal Crystal'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Bullcroft Colliery was a coal mine situated by the village of Carcroft north of Doncaster. The Bullcroft Colliery Company was formed in April 1908 and sinking of the shafts commenced immediately. In January 1909, at a depth of 100 ft , a water course yielding over 1,000 USgal per minute was struck, it was capped back and sinking continued but only a month later, at 180 ft , another water course, big enough to be described as a "subterranean river", was struck - too much for the steam operated pumps to cope with. Electric pumps were brought in to cope with the flow but even with a capability of 6,250 USgal per minute they couldn\'t cope and sinking was stopped so the full situation could be assessed.', 'title': 'Bullcroft Colliery'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Crystal Dam is a 323 ft double curvature, concrete thin arch dam located six miles downstream from Morrow Point Dam on the Gunnison River in Colorado, United States. Crystal Dam is the newest of the three dams in Curecanti National Recreation Area; construction on the dam was finished in 1976. The dam impounds Crystal Reservoir. Crystal Dam and reservoir are part of the Bureau of Reclamation's Wayne N. Aspinall Unit of the Colorado River Storage Project, which retains the waters of the Gunnison River and its tributaries for agricultural and municipal use in the American Southwest. The dam's primary purpose is hydroelectric power generation.", 'title': 'Crystal Dam'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Wendell Tre' Ming Burrows (born 11 April 1994), commonly known as Tre Ming, is a Bermudian professional footballer who currently studies at Thomas College and plays for Bermudian Premier Division side PHC Zebras.", 'title': 'Tre Ming'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Bermuda, a British Overseas Territory, enjoys one of the highest per capita incomes in the world, having successfully exploited its location by providing financial services for international firms and luxury tourist facilities for 360,000 visitors annually. The tourist industry, which accounts for an estimated 28% of GDP, attracts 84% of its business from North America. The industrial sector is small, and agriculture is now severely limited by a lack of suitable land. About 80% of food is imported. International business contributes over 60% of Bermuda's economic output; a failed independence vote in late 1995 can be partially attributed to Bermudian fears of scaring away foreign firms. Government economic priorities are the further strengthening of the tourist and international financial sectors.", 'title': 'Economy of Bermuda'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Asfour Crystal is an Egyptian crystal manufacturing company that produces crystal pieces under its own name. The company produces clear and coloured crystals for diverse uses including lighting, accessories, fashion pieces, chandeliers, figurines and special projects. At the present time, Asfour Crystal is the world’s largest manufacturer and exporter of crystal, having a production capacity that exceeds 100 tons of crystal per day and exporting to more than 50 countries across the globe.', 'title': 'Asfour crystal'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Crystal Palace Park is a Victorian pleasure ground, used for cultural and sporting events. It is located in the south-east London suburb of Crystal Palace, which was in turn named after the Crystal Palace Exhibition building, which had been moved from Hyde Park, London after the 1851 Great Exhibition and rebuilt with some modifications and enlargements to form the centrepiece of the pleasure ground, before being destroyed by fire in 1936. The park features full-scale models of dinosaurs in a landscape, a maze, lakes, and a concert bowl.', 'title': 'Crystal Palace Park'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Norwegian Cruise Line Holdings Ltd. (Norwegian) is a Bermudian company operating cruise ships, headquartered in unincorporated Miami-Dade County, Florida. It began operations in 1966 under the name Norwegian Caribbean Line. The company is best known for its Freestyle Cruising concept, which means that there are no set times or seating arrangements for meals, nor is formal attire required. Norwegian is a publicly traded company listed on NASDAQ, with major shareholders including Apollo Global Management (15.8%), Genting Group (11.1%), and TPG Capital (2.3%) as of 20 March 2017 . Norwegian Cruise Line controls approximately 8% of the total worldwide share of the cruise market.', 'title': 'Norwegian Cruise Line'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Celestyal Cruises (formerly Louis Cruises and Louis Cruise Lines) is a Cyprus-based cruise line that operates cruises from Cyprus, France, Italy, India and Greece (the operations from Greece were previously marketed under the name Louis Hellenic Cruise Lines, but as of 2008 there is no mention of the brand on Louis\' website). The company also charters several ships to Thomson Cruises. Although Celestial started operating short cruises out of Cyprus in the early 70s, Celestyal Cruises was officially established in 1986 as Louis Cruises when MV Princesa Marissa, its first owned cruise ship, was purchased. Celestyal Cruises is a subsidiary of Louis plc and member of Louis Group, the leading tourism group in the Eastern Mediterranean, founded in 1935 by the late Louis Loizou, acknowledged as the "father of Cyprus tourism".', 'title': 'Celestyal Cruises'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Hits & Ballads is a double disc compilation album released by Richard Marx exclusively in Taiwan, featuring several songs spanning his career, a few new songs, and one cover. It is his ninth overall compilation album, and second double disc compilation album.', 'title': 'Hits &amp; Ballads'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"I\'m Losing You" is a song written by John Lennon and released on his 1980 album "Double Fantasy". It was completed in Bermuda in June 1980, after Lennon failed at an attempted telephone call to Yoko Ono. The song is also available on the 1982 compilation "The John Lennon Collection", the 1998 boxset "John Lennon Anthology", the one disc compilation "Wonsaponatime", the 2005 two disc compilation "" and in 2010 for the "Gimme Some Truth" album. The song was also featured in the 2005 musical "Lennon".', 'title': "I'm Losing You (John Lennon song)"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Land is a two disc compilation album by Patti Smith, released on March 19, 2002, on Arista Records. "Land" contains a collection of recordings from her eight previous albums on the first disc, along with B-sides and unreleased songs on the second disc. The album ranked number eight in "Mojo"\'s "Best Box Sets & Compilations of 2002". It is dedicated to the memory of Richard Sohl.', 'title': 'Land (1975–2002)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Hunt Music is a compilation album by Ted Nugent. The album did not see a large release but is still available on Internet sites. The second disc contains bonus tracks recorded by Ted Nugent. "I Just Wanna Go Hunting" had been unreleased.', 'title': 'Hunt Music'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Essential "Weird Al" Yankovic is a two disc compilation album by "Weird Al" Yankovic. A limited edition "3.0" version of the album has a third disc. It is published by Sony Music\'s Legacy Recordings as part of their "The Essential" series. Yankovic selected the songs for inclusion on the album after seeking fan feedback for the choice between one of two polkas.', 'title': 'The Essential &quot;Weird Al&quot; Yankovic'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Out of the Dark is a two disc compilation album from Nuclear Blast Records to commemorate their 20 years as a record label. Produced by Peter Wichers, who is also the only songwriter on the album, it features a variable collection of ""All Stars"" much in the same vein as Roadrunner United. The album includes 11 different singers, with Wichers playing bass and guitar, and drums by Dirk Verbeuren and Henry Ranta. It also includes a second disc which includes 10 songs from thrash metal, death metal and black metal bands signed to Nuclear Blast. While its "twin" album focuses more on the power metal side of the label, "Out of the Dark" is rather devoted to the genre of melodic death metal.', 'title': 'Nuclear Blast All-Stars: Out of the Dark'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Ampology is a two disc compilation album by Australian rock group Hoodoo Gurus, spanning their entire career from their first single, "Leilani" (October 1982) through to "Real Deal" (1997). At the time of its release Hoodoo Gurus had been disbanded for two years. Lead vocalist, guitarist and chief songwriter Dave Faulkner discusses each track in his June 2000 article "Pop and punishment".', 'title': 'Ampology'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Solos and Duets is a two disc compilation album of previously released recordings from Stash Records by the father and son pair Bucky Pizzarelli and John Pizzarelli. The entire release was riddled with mistakes, such as how disc one is actually disc two and vice versa.', 'title': 'Solos and Duets'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Theodore Anthony Nugent ( ; born December 13, 1948) is an American singer-songwriter, musician and activist. Nugent initially gained fame as the lead guitarist of the Amboy Dukes, a band formed in 1963 that played psychedelic rock and hard rock. After playing with the Amboy Dukes, he embarked on a solo career.', 'title': 'Ted Nugent'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Platinum Collection is a two disc compilation album of recordings by Blondie released by EMI/Chrysalis in 1994. The forty-seven track compilation contains the A- and B-sides of all singles issued by the band in the U.S. and the UK between the years 1976 and 1982 in chronological order, five demo recordings made before the release of their debut album including an alternative version of "Heart of Glass", as well as two 1994 dance remixes of their hits "Atomic" and "Rapture".', 'title': 'The Platinum Collection (Blondie album)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Brooklyn Danielle Decker Roddick (born April 12, 1987) is an American fashion model and actress best known for her appearances in the "Sports Illustrated Swimsuit Issue", including the cover of the 2010 issue. In addition to working for Victoria\'s Secret for the 2010 "Swim" collection, she has ventured into television with guest appearances on "Chuck", "Ugly Betty", "The League", and "Royal Pains". She made her feature film debut in "Just Go with It", and later starred in "Battleship" and "What to Expect When You\'re Expecting". Decker is married to former tennis player Andy Roddick.', 'title': 'Brooklyn Decker'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 2010 Aegon Championships (also known traditionally as the "Queen\'s Club Championships") was a tennis tournament played on outdoor grass courts. It was the 39th edition of the Aegon Championships and was part of the ATP World Tour 250 series of the 2010 ATP World Tour. It took place at the Queen\'s Club in London, United Kingdom, from 7 to 13 June 2010. The field was headlined by the 2008 champion and current world number one Rafael Nadal, Novak Djokovic, Andy Roddick and defending champion Andy Murray.', 'title': '2010 Aegon Championships'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Andrew Stephen Roddick (born August 30, 1982) is an American former professional tennis player from the US.', 'title': 'Andy Roddick'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'This is a list of the main career statistics of retired professional American tennis player, Andy Roddick. Throughout his career, Roddick won thirty-two ATP singles titles including one grand slam singles title and five ATP Masters 1000 singles titles. He was also the runner-up at the Wimbledon Championships in 2004, 2005 and 2009 and the US Open in 2006, losing on all four occasions to Roger Federer. Roddick was also a four-time semi-finalist at the Australian Open and a three-time semi-finalist at the year-ending ATP World Tour Finals. On November 3, 2003, Roddick became the World No. 1 for the first time in his career.', 'title': 'Andy Roddick career statistics'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Andy Roddick Foundation is a nonprofit organization focused on closing the educational achievement gap by providing children with abundant opportunities outside the school day. The Andy Roddick Foundation understands that talent is universal but opportunity is not and knows that opportunity matters. By addressing this ongoing opportunity gap that exists between lower income students and their peers, all students can grow, thrive, and succeed. To do this, the Andy Roddick Foundation is building high-quality summer learning opportunities, making investments in effective afterschool and summer programs, and partnering with others to collectively impact that future of students in the Austin community by ensuring they have access to high-quality opportunities outside the school day. This is all designed to build resilient students that have the skills, traits, and opportunities needed to reach their full potential.', 'title': 'Andy Roddick Foundation'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Andy Roddick was the defending champion and won in the final 7–6, 7–6 against Ivo Karlović. This was the first ATP tournament of future World No. 1 Andy Murray in his professional debut.', 'title': '2005 Stella Artois Championships – Singles'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Federer–Roddick rivalry was a rivalry between two professional tennis players, Roger Federer of Switzerland and Andy Roddick of the United States. The two met 24 times in official Association of Tennis Professionals (ATP) matches, and Federer led 21–3, making Roddick the player with the second-most tournament defeats to Federer in the ATP circuit (Novak Djokovic has lost to Federer on 22 occasions, but holds a positive record against him). In terms of number of matches played, it ranks as the 14th largest rivalry in the Open Era.', 'title': 'Federer–Roddick rivalry'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Janko Tipsarević (, ] ; born 22 June 1984) is a Serbian professional tennis player. His career-high singles ranking is world No. 8, achieved on 2 April 2012. In his career, he has won four ATP World Tour titles, one ATP doubles title, three Futures, and 15 Challenger titles. Tipsarević also won the 2001 Australian Open Junior title. Tipsarević has achieved two victories over a World No. 1 player, having defeated compatriot Novak Djokovic twice. He also has thirteen victories against other players in the top 10: four wins against Tomáš Berdych, and one each against Fernando González, Mikhail Youzhny, David Ferrer, James Blake, Gaël Monfils, Andy Murray and Juan Mónaco. He holds victories over former World No. 1 players Carlos Moyá, Marat Safin, Lleyton Hewitt, Juan Carlos Ferrero and Andy Roddick. His best results at a Grand Slam have been reaching the quarterfinals at the US Open in 2011 and 2012. He is only the second Serb to reach the final 16 at all four different grand slams.', 'title': 'Janko Tipsarević'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Boodles Tennis Challenge (former Boodle and Dunthorne Champions Challenge) is an international five-day tennis exhibition held at Stoke Park in Buckinghamshire, England. In coordination with Boodles, a luxury jeweler, it was initially founded by veteran sports agent Patricio Apey as an event to help players hone their grass court skills in the lead-up to Wimbledon. It is played in a similar style to the AAMI Classic giving the players at least three matches each and allowing non competition players to appear in one match per a day. Over recent years Andre Agassi, Pete Sampras, Tim Henman, Marat Safin, James Blake, Andy Roddick, Fernando González, David Nalbandian, Novak Djokovic, Fernando Verdasco, Jo-Wilfried Tsonga and Andy Murray have all appeared. Since its inception, The Boodles has turned into a lifestyle event featuring British luxury brands such as Boodles, Veuve Clicquot and H.R. Owen.', 'title': 'Boodles Challenge'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Bobby Reynolds and Andy Roddick were the defending champions, but Reynolds did not participate this year. Roddick partnered Mardy Fish, making it to the quarterfinals before withdrawing from the event.', 'title': '2007 Indianapolis Tennis Championships – Doubles'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Wisoon Wichaya (also Visuth Vichaya) is a Thai football coach Thailand Premier League side Sisaket F.C.. He was formerly the coach of Bangkok Bank FC and has also coached the national under-23 team at the 2006 Asian Games.', 'title': 'Wisoon Wichaya'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Khalifa International Tennis and Squash Complex is a tennis complex in Doha, Qatar. The center is owned and operated by the Qatar Tennis Federation. It is the home venue of the ATP World Tour's Qatar ExxonMobil Open and WTA event Qatar Total Open. It formerly hosted the year-ending WTA Tour Championships in 2008-2010. It has also hosted the tennis and squash competitions at the 2006 Asian Games held in Doha.", 'title': 'Khalifa International Tennis and Squash Complex'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Mohd Nor Farhan Bin Muhammad, P.B. (born 19 December 1984) is a Malaysian footballer who plays as forward and attacking midfielder for Liga Super side Kelantan and Malaysian national team. His international senior debut was against Singapore on 31 May 2006. He also played in 2006 Asian Games in Doha, Qatar represented Malaysia U-23 team. During the first match of the 2015 Asian Cup qualifiers against Qatar Farhan only played in the second half. It ended with his team losing 0–2 to Qatar in the match.', 'title': 'Nor Farhan Muhammad'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'At the 2005 West Asian Games, the athletics events were held at the Khalifa International Stadium in Doha, Qatar. Contested over three days, from 7 to 9 December, it was the first time that women were allowed to compete in athletics events at the Games. A total of 28 events were contested, of which 23 by male and 5 by female athletes. The event was seen as a test event for the Athletics at the 2006 Asian Games, which Doha hosted the following year.', 'title': 'Athletics at the 2005 West Asian Games'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': "Football at the 2006 Asian Games was held in Doha, Qatar from November 18 to December 15, 2006. The opening match was played 14 days prior to the opening ceremony. In this tournament, some 30 teams played in the men's competition, and 8 teams participated in women's competition.", 'title': 'Football at the 2006 Asian Games'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Chinese Taipei () competed in the 2006 Asian Games in Doha, Qatar in November and December 2006. The Chinese Taipei team sent 399 athletes to the games, making Chinese Taipei the fourth largest delegation after China, Japan, and South Korea. Despite Taiwan's small size, Chinese Taipei is a second-rank Asian sports power, finishing tenth in gold medals and seventh in overall medals at the 2006 Asian Games, a slight drop from its performance in the 2002 Asian Games in Busan, South Korea.", 'title': 'Chinese Taipei at the 2006 Asian Games'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The 2006 Asian Games, officially known as the XV Asiad, were held in Doha, Qatar from December 1 to December 15, 2006. A total of 13,000 athletes from 45 nations in the Asia competed in 424 in 39 sports. The games were the largest international multi-sport event to be staged in Doha and in Qatar. Events took place at 21 competition venues. Other venues in the games included the Asian Games Village and the Main Media Center.', 'title': 'Venues of the 2006 Asian Games'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The 2006 Asian Games (Arabic: دورة الألعاب الآسيوية 2006\u200e \u200e , "Dawrat al-ʼAl‘ab al-Asīawīah"), officially known as the XV Asiad, was an Asian multi-sport event held in Doha, Qatar from December 1 to December 15, 2006 with 424 events in 39 sports and disciplines featured in the games. Doha was the first city in its region and only the second in West Asia (following Tehran in 1974) to host the games.', 'title': '2006 Asian Games'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The 2006 Asian Games Opening Ceremony was held in Doha, Qatar on 1 December 2006 to mark the start of the 15th Asian Games. The ceremony took place in the multi-purpose Khalifa International Stadium, which was specifically renovated for the Asian Games. The ceremony was attended by over 50,000 spectators, as well as approximately 20,000 athletes and performers. Several Asian heads-of-state and the President of the International Olympic Committee Jacques Rogge were in attendance. The officials and organizers of the ceremony promised it to be the most spectacular opening ceremony in recent years. The Opening Ceremony was described by the media to be one of the most breath-taking and technologically spectacular multi-sports event ceremony, and the most expensive multi-sports event ceremony (including both Opening and Closing ceremonies) in the history of Asian Games.', 'title': '2006 Asian Games opening ceremony'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Mark Pinili Javier (born October 20, 1981) is a professional archer from the Philippines. He competed in Archery at the 2006 Asian Games in Doha, Qatar but was defeated by the Korean Im Dong Hyun 113-104 in the 1/16 Elimination Round. During the 2006 Asian Games he landed 9th place in the individual category.', 'title': 'Mark Javier'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Gregory Frank "Greg" Raposo (born May 3, 1985) is an American rock\'n\'roll singer and actor. Raposo initially came to fame in the early 2000s as a member of the boy band Dream Street, but has subsequently branched out into a solo career as a rock singer. His self-titled debut solo album "Greg Raposo" was released in 2003 and charted at #40 in its opening week; 2012 release "Loss Love Life" was released independently and did not chart.', 'title': 'Gregory Raposo'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Grey Will Fade is the debut album from British singer/songwriter Charlotte Hatherley, released in 2004 whilst still playing guitar in British rock band Ash. She was encouraged to write the album by Ash frontman Tim Wheeler due to the popularity of the song, "Grey Will Fade," originally released as a B-side on Ash\'s 2001 single "There\'s a Star." The album reached number 51 in the UK Albums Chart. </small>', 'title': 'Grey Will Fade'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Ash is a Northern Irish alternative rock band, formed in Downpatrick in 1992 by vocalist and guitarist Tim Wheeler, bassist Mark Hamilton and drummer Rick McMurray. As a three-piece, they released mini-album "Trailer" in 1994 and full-length album "1977" in 1996. This 1996 release was named by "NME" as one of the 500 greatest albums of all time. After the success of their full debut the band recruited Charlotte Hatherley as a guitarist and vocalist, releasing their second record "Nu-Clear Sounds" in 1998. After narrowly avoiding bankruptcy the band released "Free All Angels" in 2001 and a string of successful singles.', 'title': 'Ash (band)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Druid was a 1970s progressive rock band from England, and initially came to public attention by winning a 1974 unsigned band contest by "Melody Maker" magazine. The band went on to perform on "The Old Grey Whistle Test" and to record two albums. Their sound was notably influenced by Yes.', 'title': 'Druid (band)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'NZCA Lines (stylised as NZCA/LINES) are a British synthpop band founded by Michael Lovett. It currently features Charlotte Hatherley and Sarah Jones.', 'title': 'NZCA Lines'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Inayat Khan Rehmat Khan Pathan (Urdu: عنایت خان\u200e ; July 5, 1882 – February 5, 1927) was the founder of The Sufi Order in the West in 1914 (London) and teacher of Universal Sufism. He initially came to the West as a Northern Indian classical musician, having received the honorific "Tansen" from the Nizam of Hyderabad, but he soon turned to the introduction and transmission of Sufi thought and practice. Later, in 1923, the Sufi Order of the London period was dissolved into a new organization, formed under Swiss law, called the "International Sufi Movement". His message of divine unity (Tawhid) focused on the themes of love, harmony and beauty. He taught that blind adherence to any book rendered religion devoid of spirit. Branches of Inayat Khan\'s movement can be found in the Netherlands, France, England, Germany, the United States, Canada, Russia and Australia. In his various written works, such as the Music of Life and The Mysticism of Sound and Music, Inayat Khan interlocks his passion for music with his Sufi ideologies making a compelling argument for music as the harmonious thread of the Universe.', 'title': 'Inayat Khan'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Pope Clement VIII (Latin: "Clemens VIII" ; 24 February 1536 – 3 March 1605), born Ippolito Aldobrandini, was Pope from 2 February 1592 to his death in 1605. Born into prominent Florentine family, he initially came to prominence as a canon lawyer before being made a Cardinal-Priest in 1585. In 1592 he was elected Pope and took the name of Clement. During his papacy he effected the reconciliation of Henry IV of France to the Catholic faith and was instrumental in setting up an alliance of Christian nations to oppose the Ottoman Empire in the so-called Long War. He also successfully adjudicated in a bitter dispute between the Dominicans and the Jesuits on the issue of efficacious grace and free will. In 1600 he presided over a jubilee which saw a large number of pilgrimages to Rome. He showed little pity for his perceived opponents, presiding over the trial and execution of Giordano Bruno and introducing harsh measures against Jewish inhabitants of the Papal States. He may have been the first pope to drink coffee. Clement VIII died at the age of 69 in 1605 and his remains now rest in the Santa Maria Maggiore.', 'title': 'Pope Clement VIII'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'José Francisco Araiza Andrade (born 4 October 1950), is a Mexican operatic tenor and lied singer who has sung as soloist in leading concert halls and in leading tenor operatic roles in the major opera houses of Europe and North America during the course of a lengthy career. Born in Mexico City, he studied singing at the Conservatorio Nacional de Música de México and later in Germany, with Mozartian tenor Richard Holm, and lieder interpretation with Erik Werba. He made his operatic debut in 1970 in Mexico City as First Prisoner in Beethoven\'s "Fidelio". Araiza initially came to international prominence singing in Mozart and Rossini operas, but in the 1980s broadened his repertoire to include Italian and French lyric tenor roles and Wagnerian roles such as Lohengrin and Walther von Stolzing. He was made a Kammersänger of the Vienna State Opera in 1988. Now retired from the opera stage, he teaches singing and serves on the juries of several international singing competitions.', 'title': 'Francisco Araiza'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Doberman is a Japanese ska/punk band. In 1998, the members of Doberman initially came together while studying art at Osaka University. However, the band did not fully launch and emerge into the music world until a year later. This nine member ensemble undoubtedly contributes to Japan's ska scene, especially influencing the 2 Tone and Neoska subgenres, flavored by their own mixture of two tone and authentic ska.", 'title': 'Doberman (band)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Charlotte Franklin Hatherley (born 20 June 1979) is an English singer, songwriter and guitarist. She initially came to prominence as guitarist and backing vocalist for alternative rock band Ash. Since leaving Ash in 2006, she has pursued a solo career and also acted as a touring instrumentalist for Client, KT Tunstall, Bat for Lashes and Birdy. Hatherley is now performing solo under the moniker of Sylver Tongue and as a recording and touring member of NZCA Lines.', 'title': 'Charlotte Hatherley'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"FutureSex/LoveSound" is a song recorded by American singer and songwriter Justin Timberlake for his second studio album, "FutureSex/LoveSounds" (2006). It was written and produced by Timberlake, Timothy "Timbaland" Mosley and Nate "Danja" Hills. The song was produced following Timberlake\'s two-year hiatus from the music industry, when he felt "burnt out" after the release of his debut solo album "Justified" in 2002. "FutureSex/LoveSound" incorporates elements of new wave and industrial rock into its production. The song received generally mixed reviews from music critics, with some of them praising its production and others criticizing its simplistic lyrics. Following the release of the album, "FutureSex/LoveSound" peaked at number 13 on the "Billboard" Bubbling Under Hot 100 Singles chart. It was included on the set list of Timberlake\'s second worldwide tour FutureSex/LoveShow (2007).', 'title': 'FutureSex/LoveSound'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"I Think We\'re Alone Now" is a song written and composed by Ritchie Cordell that was the title selection for a highly successful album released by the American recording artists Tommy James and the Shondells. "I Think We\'re Alone Now" was a 1967 US hit for James and the Shondells, reaching number 4 on the "Billboard" Hot 100 chart. The song has since been covered several times by other artists. The late 1987 recording by Tiffany reached number 1 on the charts of various countries including the US, UK, Canada, and New Zealand. One month earlier, another Tommy James song had also hit number 1—Billy Idol\'s version of "Mony, Mony". Other cover versions have also charted, including those by The Rubinoos (number 45 US, 1977) and Girls Aloud (number 4 UK, 2006).', 'title': "I Think We're Alone Now"}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': '"SexyBack" is a song recorded by American singer-songwriter Justin Timberlake for his second studio album, "FutureSex/LoveSounds" (2006). It was released on July 18, 2006, to US mainstream and rhythmic radio stations by Jive Records as the lead single from the album. The song was written and produced by Nate Hills, Tim Mosley, and Timberlake himself. Discussing "SexyBack", Timberlake revealed that he went "left", singing the song in a rock style, not an R&B style. He described the song as musicians David Bowie and David Byrne "covering" James Brown\'s 1970 song "Sex Machine". The track features Timbaland on backing vocals, while Timberlake\'s voice is distorted. The instrumentation used in the song includes a pounding bass beat, electronic chords, and drum machine sounds.', 'title': 'SexyBack'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The discography of B*Witched, an Irish pop girl group, consists of two studio album, one extended play and one compilation. The group released their debut single "C\'est la Vie" on 25 May 1998. Despite mixed reviews, it reached Number 1 on the UK charts, making them the youngest female group ever to do so, and also made Number 9 in the US. Subsequent singles "Rollercoaster", "To You I Belong" and "Blame It on the Weatherman" also topped the UK charts. The group\'s debut album, "B*Witched", was released in October 1998, reaching Number 3 in the UK charts and was certified Double Platinum in the UK and Platinum in the US. B*Witched\'s second album, "Awake and Breathe", released almost exactly a year after their debut, peaked at Number 5 on the charts and was certified Platinum. Singles from the album were less successful than earlier releases ("Jesse Hold On" reached Number 4, "I Shall Be There" Number 13 and "Jump Down" Number 16 in the UK). The latter two appeared on their new American EP, "Across America 2000", along with live tracks and the earlier cover of "Does Your Mother Know". However, in September 2002, the group officially split when O\'Carroll decided to leave the band.', 'title': 'B*Witched discography'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': '"Rudebox" is song by English musician Robbie Williams, from the his seventh studio album of the same name (2006). It is based on a sample from the song "Boops (Here to Go)" by Sly and Robbie. The single was released on 4 September 2006, although download purchases allowed it to reach number 30 on the UK Singles Chart on 3 September. After the release of the CD single, it ascended 26 places to number 4, selling 24,821 copies, beaten by Nelly Furtado featuring Timbaland\'s "Promiscuous", Justin Timberlake\'s "SexyBack" and Scissor Sisters\' "I Don\'t Feel Like Dancin\'".', 'title': 'Rudebox (song)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Between Now and Forever is the second studio album by American country music artist Bryan White. It was released in 1996 (see 1996 in country music) on Asylum Records. Like his debut album "Bryan White", it was certified platinum by the RIAA for U.S. sales of one million copies. The album produced four singles for White on the "Billboard" Hot Country Singles & Tracks (now Hot Country Songs) charts. In order of release, these were "I\'m Not Supposed to Love You Anymore" (number 4), "So Much for Pretending" (number 1), "That\'s Another Song" (number 15), and "Sittin\' on Go" (number 1). "Sittin\' on Go" was also his last Number One hit.', 'title': 'Between Now and Forever'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Daddy Don\'t You Walk So Fast" is a song written by Peter Callander and Geoff Stephens and performed by Wayne Newton. It sold over one million copies and was awarded a gold disc by the RIAA in July 1972. The song reached number 3 on the adult contemporary chart, and number 4 on the "Billboard" Hot 100. The song spent one week at number 1 on the "Cashbox" chart on August 5, 1972, one week at number 1 in Canada, and spent three weeks at number 1 in Australia. The song appeared on Newton\'s 1972 album, "Daddy Don\'t You Walk So Fast".', 'title': "Daddy Don't You Walk So Fast"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Dead and Gone" is a song by American hip hop recording artist T.I., featuring American singer-songwriter Justin Timberlake. It was released as the eighth single from T.I.\'s sixth studio album, "Paper Trail" (2008). Due to the high number of digital downloads upon the album\'s release, the song debuted on the "Billboard" Hot 100 before its official single release. The song marked the second collaboration between T.I. and Justin Timberlake, the first being the hit single "My Love", from Timberlake\'s second album, "FutureSex/LoveSounds" (2006). T.I. and Timberlake performed this song at the 51st Grammy Awards. The song was later nominated twice at the 52nd Grammy Awards, for Best Rap/Sung Collaboration and Best Rap Song. It was the 10th bestselling digital single of 2009 in the United States. As of 2012, it had sold 3.1 million copies in the country.', 'title': 'Dead and Gone'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"I Want to Be Loved Like That" is a song written by Phil Barnhart, Sam Hogin and Bill LaBounty, and recorded by American country music band Shenandoah. It was released in September 1993 as the second single from the album "Under the Kudzu". The song spent twenty weeks on the Hot Country Songs charts, reaching a peak of number 3. It also went to number 2 on "Gavin Report" and number 1 on "Radio & Records". The song also peaked at number 4 on the "RPM" Country Tracks charts dated for January 24, 1994.', 'title': 'I Want to Be Loved Like That'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Galveston" is a song written by Jimmy Webb and popularized by American country music singer Glen Campbell who recorded it with the instrumental backing of members of The Wrecking Crew. In 2003, this song ranked number 8 in "CMT\'s 100 Greatest Songs in Country Music". Campbell\'s version of the song also went to number 1 on the country music charts. On other charts, "Galveston" went to number 4 on the "Billboard" Hot 100 and number one on the "Easy Listening" charts. It was certified gold by the RIAA in October 1969.', 'title': 'Galveston (song)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Ragdale is the summer retreat of Chicago architect Howard Van Doren Shaw, located in Lake Forest, Illinois. It is also the home of the Ragdale Foundation. Built in 1897, the house and barn were built in Shaw's typical Arts and Crafts manner.", 'title': 'Ragdale'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'This is a list of houses, commercial buildings, factories, and other structures by architect Howard Van Doren Shaw. Many of his buildings are now listed on the National Register of Historic Places (NRHP), either individually or as a contributing property to a historic district.', 'title': 'List of works by Howard Van Doren Shaw'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The Parachute murder is a name the Belgian media gave the 2010 Belgian love triangle skydiving murder trial. The defendant, elementary school teacher and amateur skydiver Els 'Babs' Clottemans, was found guilty of murder by sabotaging the parachutes of another woman, fellow skydiver Els Van Doren, because Van Doren was a rival for the love of Marcel Somers, also a skydiver. The skydive in which Van Doren died occurred on November 18, 2006. Van Doren, who was a 38 years old married mother of two and a very experienced skydiver, died when both her primary and reserve parachutes failed to deploy. The dive was captured by a video camera mounted on Van Doren's helmet. Van Doren dropped from a height of over 2 mi landing in a garden in the town of Opglabbeek. Police later established that the cords of the parachute had been cut.", 'title': 'Parachute Murder'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Dr. Van Buren Knott House is a historic building located in Sioux City, Iowa, United States. Knott was a prominent local physician. He had Chicago architect Howard Van Doren Shaw design this Colonial Revival-style house, which is considered an excellent example of the style. The 2½-story brick structure features a symmetrical facade, an entrance porch with Doric columns, a Palladian window above the front entrance, a single-story semi-circular room in the back, and a hip roof roof with dormers. On the south side of the house is a full width porch, with a sleeping porch on the second floor. A pergola in the back leads to a detached two-car garage, which was built a couple of years after the house. The house and garage were listed together on the National Register of Historic Places in 1999.', 'title': 'Dr. Van Buren Knott House'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Marktown is an urban planned worker community in East Chicago, Indiana, United States, built during the Progressive Era in 1917 from marshland to provide a complete community for workers at The Mark Manufacturing Company.', 'title': 'Marktown'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Deerpath Hill Estates is a residential development in western Lake Forest, Illinois. Developer Henry K. Turnbull and architect Stanley D. Anderson planned and built the original development in 1926. Turnbull and Anderson designed the development according to the principles of the City Beautiful Movement and the ideas of Howard Van Doren Shaw, Anderson's mentor. The individual houses were designed in popular revivalist styles, including English Tudor, Colonial, and French Norman. The development was the first in Lake Forest to be planned and controlled entirely by its developer.", 'title': 'Deerpath Hill Estates'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The Lakeside Press Building is a historic commercial building located at 731 S. Plymouth Ct. in downtown Chicago, Illinois. The building served as a showroom, office, and printing press for the Lakeside Press. The building was built in two stages; the southern half was completed in 1897, while the northern half was finished in 1901. Architect Howard Van Doren Shaw designed the building, his first design of a commercial building. Shaw's design features limestone quoins, piers, and decorations, curtain walls with cast iron spandrels on the floors housing the printing presses, and a projecting cornice.", 'title': 'Lakeside Press Building'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Howard Van Doren Shaw AIA (May 7, 1869 – May 7, 1926) was an American architect. He became one of the best-known architects of his generation in the Chicago, Illinois area. Shaw was considered a leader in the American Craftsman movement, best exemplified in his 1900 remodel of Second Presbyterian Church in Chicago. He designed Marktown, Clayton Mark's planned worker community in Northwest Indiana.", 'title': 'Howard Van Doren Shaw'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Seven Houses on Lake Shore Drive District is a historic district in Chicago, Illinois, United States. The district was built between 1889 and 1917 by various architects including Benjamin Marshall, Holabird & Roche, Howard Van Doren Shaw, and McKim, Mead & White. It was designated a Chicago Landmark on June 28, 1989.', 'title': 'Seven Houses on Lake Shore Drive District'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Camp-Woods, is a historic estate with associated buildings located at Villanova, Delaware County, Pennsylvania and built on a 400\' high spot which had been a 200-man outpost of George Washington\'s Army during the Valley Forge winter of 1777-8. The house, built between 1910 and 1912 for banker James M. Willcox, is a two-story, brick and limestone, "F"-shaped house in an Italianate-Georgian style. It measures 160 feet in length and 32 feet deep at the "waist." It has a slate roof, Doric order limestone cornice, open loggia porches, and a covered entrance porch supported by Doric order columns. The house was designed by noted architect Howard Van Doren Shaw (1869-1926). The property includes formal gardens. Its former carriage house is no longer part of the main estate. The original tennis court is now also a separate property named "Outpost Hill". The Revolutionary encampment is marked by a flagpole in a circular stone monument at the north-western edge of the property. The inscription reads, "An outpost of George Washington\'s Army encamped here thro the winter of Valley Forge 1777-1778".', 'title': 'Camp-Woods'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Nevada Legislature is the state legislature of the U.S. state of Nevada. The Legislature is a bicameral body, consisting of the lower house Nevada Assembly, with 42 members, and the upper house Nevada Senate, with 21 members. All 63 members of the Legislature are elected from an equal amount of constituent districts across the state. The Legislature is the third smallest bicameral state legislature in the United States (the Alaska Legislature is the smallest bicameral, with only 60 members and the Delaware General Assembly has 62 members).', 'title': 'Nevada Legislature'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The California State Assembly is the lower house of the California State Legislature. It consists of 80 members, with each member representing at least 465,000 people. Due to the state's large population and relatively small legislature, the State Assembly has the largest population-per-representative ratio of any state lower house and second largest of any legislative lower house in the United States after the federal House of Representatives. As a result of Proposition 140 in 1990 and Proposition 28 in 2012, members elected to the legislature prior to 2012 are restricted by term limits to three two-year terms (six years), while those elected in or after 2012 are allowed to serve 12 years in the legislature in any combination of four-year state senate or two-year state assembly terms.", 'title': 'California State Assembly'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Romeo Munoz Cachola, commonly known as Romy Cachola, is a Democratic politician from the state of Hawaii. An emigrant from the Philippines, Cachola became one of the first Filipino Americans to be elected to the Honolulu City Council since statehood in 1959. He also was a member of the Hawaii State Legislature and served in the Hawaii State House of Representatives from 1984 to 1992.', 'title': 'Romeo Munoz Cachola'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "The Hawaii House of Representatives is the lower house of the Hawaii State Legislature. Pursuant to Article III, Section 3 of the Hawaii Constitution, amended during the 1978 constitutional convention, the House of Representatives consists of 51 members representing an equal amount of districts across the islands. It is led by the Speaker of the House elected from the membership of the House, with majority and minority leaders elected from their party's respective caucuses. The current Speaker of the House is Scott Saiki.", 'title': 'Hawaii House of Representatives'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Hawaii State Legislature is the state legislature of the U.S. state of Hawaii. The state legislature is a bicameral body consisting of a lower house, the Hawaii State House of Representatives, with 51 representatives, and an upper house, the 25-member Hawaii State Senate. There are a total of 76 representatives in the legislature, each representing single member districts across the islands. The powers of the legislature are granted under Article III of the Constitution of Hawaii.', 'title': 'Hawaii State Legislature'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Hawaii State Capitol is the official statehouse or capitol building of the U.S. state of Hawaii. From its chambers, the executive and legislative branches perform the duties involved in governing the state. The Hawaii State Legislature—composed of the twenty-five member Hawaii State Senate led by the President of the Senate and the fifty-one member Hawaii State House of Representatives led by the Speaker of the House—convenes in the building. Its principal tenants are the Governor of Hawaii and Lieutenant Governor of Hawaii, as well as all legislative offices and the Legislative Reference Bureau.', 'title': 'Hawaii State Capitol'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Arizona State Legislature is the state legislature of the U.S. state of Arizona. It is a bicameral legislature that consists of a lower house, the House of Representatives, and an upper house, the Senate. Composed of 90 legislators, the state legislature meets in the Capitol Complex in the state capital of Phoenix, Arizona. Created by the Arizona Constitution upon statehood in 1912, the Arizona State Legislature met biennially until 1950. Today, they meet annually.', 'title': 'Arizona State Legislature'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The West Virginia Legislature is the state legislature of the U.S. state of West Virginia. A bicameral legislative body, the Legislature is split between the upper Senate and the lower House of Delegates. It was established under Article VI of the West Virginia Constitution following the state\'s split from Virginia during the American Civil War in 1863. As with its neighbor and former constituent Virginia General Assembly, the legislature\'s lower house is also referred to as a "House of Delegates."', 'title': 'West Virginia Legislature'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Hawaiʻi State Senate is the upper chamber of the Hawaii State Legislature. The senate consists of twenty-five members elected from an equal number of constituent districts across the islands. The senate is led by the President of the Senate, elected from the membership of the body, currently Ron Kouchi. The forerunner of the Hawaii State Senate during the government of the Kingdom of Hawaiʻ i was the House of Nobles originated in 1840. In 1894 the Constitution of the Republic of Hawaii renamed the upper house the present senate. Senators are elected to four-year terms and are not subject to term limits. Like most state legislatures in the United States, the Hawaii State Senate is a part-time body and senators often have active careers outside government. The lower chamber of the legislature is the Hawaiʻi House of Representatives. The membership of the Senate also elects additional officers to include the Senate Vice President, Senate Chief Clerk, Assistant Chief Clerk, Senate Sergeant at Arms and Assistant Sergeant at Arms.', 'title': 'Hawaii Senate'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Robert "Bobby" Bunda (born April 25, 1947) is a former Democratic member of the Hawaii Senate, representing the 22nd District from 1994 through 2010, when he resigned his position in an unsuccessful bid for Lieutenant Governor of Hawaii. Previously he was a member of the Hawaii House of Representatives from 1983 through 1994.', 'title': 'Robert Bunda'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Federation of Conservative Students (FCS) was the student organisation of the British Conservative Party from the late 1940s to 1986. It was created to act as a bridge between the student movement and the Conservative Party. In its final years it became known colloquially as "Maggie\'s Militant Tendency", in reference to then Prime Minister Margaret Thatcher and to Militant, an entryist group active in the Labour Party at the time. The FCS was then broken up by the Chairman of the Conservative Party, Norman Tebbit, after one of its members had accused previous former Prime Minister Harold Macmillan of war crimes in extraditing Cossacks to the Soviet Union. The FCS was replaced by the Conservative Collegiate Forum.', 'title': 'Federation of Conservative Students'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The later life of Winston Churchill documents the life of the British statesman from the end of World War II and his second term as Prime Minister of the United Kingdom, until his subsequent death and funeral in 1965. After the end of the war Churchill had to step down as Prime Minister of the United Kingdom because the Conservative Party lost the 1945 election. For six years he was to serve as the Leader of the Opposition. During these years Churchill continued to influence world affairs; in 1946 he gave his Iron Curtain speech which spoke of the expansionist policies of the USSR and the creation of the Eastern Bloc; Churchill also argued strongly for British independence from the European Coal and Steel Community (which he saw as a Franco-German project as Britain still had an empire). In the General Election of 1951 Labour was defeated and Churchill became Prime Minister for a second time. Churchill continued to lead Britain but was to suffer increasingly from health problems. Aware that he was slowing down both physically and mentally he resigned from the Cabinet in 1955. However he continued to sit as an MP for Woodford until he retired from politics in 1964. Churchill died on 24 January 1965 and was granted the honour of a state funeral. He was buried in his family plot in St Martin's Church, Bladon near to where he was born at Blenheim Palace.", 'title': 'Later life of Winston Churchill'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Local elections were held in the United Kingdom in 1991. The results were a setback for the governing Conservative Party, who were left with their lowest number of councillors since 1973 - though their popular vote was an improvement from the 1990 local elections (John Major had succeeded Margaret Thatcher as prime minister in November 1990), and the Conservatives would go on to win the general election in 1992.', 'title': 'United Kingdom local elections, 1991'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Sir John Major, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (born 29 March 1943) is a British politician who was Prime Minister of the United Kingdom and Leader of the Conservative Party from 1990 to 1997. He served as Foreign Secretary and then Chancellor of the Exchequer in the Thatcher Government from 1989 to 1990, and was the Member of Parliament (MP) for Huntingdon from 1979 until he retired in 2001. Since Margaret Thatcher\'s death in 2013, he is the oldest living former Prime Minister.', 'title': 'John Major'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "The 1997 Conservative Party leadership election was triggered in the British Conservative Party when John Major resigned on 2 May 1997, following his party's defeat at the 1997 general election, which ended 18 years of Conservative Government of the United Kingdom. Major had been Conservative leader and Prime Minister since November 1990.", 'title': 'Conservative Party (UK) leadership election, 1997'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Christian Homann Schweigaard (14 October 1838 – 24 March 1899 ) was a Norwegian Prime Minister. He was the Prime Minister of Norway for three months in 1884, a period after the impeachment of Prime Minister Christian August Selmer called Schweigaard's Ministerium. Schweigaard held a number of key positions, including Chairman of the Conservative Party from 1889–1891 and 1893–1896, as well as Parliamentary Leader from 1889-1891 and 1894–1895. He was Emil Stang's indispensable partner, leading the Conservative Party's policy and organizational development in the 1880s and 1890s.", 'title': 'Christian Homann Schweigaard'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Clement Richard Attlee, 1st Earl Attlee, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (3 January 1883 – 8 October 1967) was a British Labour politician who served as Prime Minister of the United Kingdom from 1945 to 1951 and Leader of the Labour Party from 1935 to 1955. In 1940, Attlee took Labour into the wartime coalition government and served under Winston Churchill, becoming the first person to hold the office of Deputy Prime Minister of the United Kingdom. He went on to lead the Labour Party to an unexpected landslide victory at the 1945 general election; forming the first Labour majority government, and a mandate to implement its postwar reforms. The 12.0% national swing from the Conservatives to Labour was unprecedented at that time and remains the largest ever achieved by any party at a general election in British electoral history. He was re-elected with a narrow majority at the 1950 general election. In the following year, Attlee called a snap general election, hoping to increase his parliamentary majority. However, he was narrowly defeated by the Conservatives under the leadership of Winston Churchill; despite winning the most votes of any political party in any general election in British political history until the Conservative Party\'s fourth consecutive victory in 1992. Attlee remains the longest-ever serving Leader of the Labour Party.', 'title': 'Clement Attlee'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Conservative Party, officially the Conservative and Unionist Party, is a centre-right political party in the United Kingdom. It is currently the governing party, having been so since the 2010 general election, where a coalition government with the Liberal Democrats was formed. In 2015, the Conservatives led by David Cameron won a surprise majority and formed the first Conservative majority government since 1992. However, the 2017 snap election on Thursday 8 June resulted in a hung parliament, and the Conservatives lost their parliamentary majority. They are reliant on the support of a Northern Irish political party, the Democratic Unionist Party (DUP), in order to command a majority in the House of Commons through a confidence-and-supply deal. The party leader, Theresa May, has served as both Leader of the Conservative Party and Prime Minister since 13 July 2016. It is the largest party in local government with 9,237 councillors. The Conservative Party is one of the two major contemporary political parties in the United Kingdom, the other being its modern rival, the Labour Party. The Conservative Party's platform involves support for free market capitalism, free enterprise, fiscal conservatism, a strong national defence, deregulation, and restrictions on trade unions.", 'title': 'Conservative Party (UK)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Margaret Hilda Thatcher, Baroness Thatcher, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (née\xa0Roberts ; 13 October 1925\xa0– 8 April 2013) was a British stateswoman who was Prime Minister of the United Kingdom from 1979 to 1990 and Leader of the Conservative Party from 1975 to 1990. She was the longest-serving British prime minister of the 20th century and the first woman to have been appointed. A Soviet journalist dubbed her the "Iron Lady", a nickname that became associated with her uncompromising politics and leadership style. As Prime Minister, she implemented policies that have come to be known as Thatcherism.', 'title': 'Margaret Thatcher'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Benjamin Disraeli, 1st Earl of Beaconsfield, (21 December 1804\xa0– 19 April 1881) was a British statesman of the Conservative Party who twice served as Prime Minister of the United Kingdom, as well as a novelist. He played a central role in the creation of the modern Conservative Party, defining its policies and its broad outreach. Disraeli is remembered for his influential voice in world affairs, his political battles with the Liberal Party leader William Ewart Gladstone, and his one-nation conservatism or "Tory democracy". He made the Conservatives the party most identified with the glory and power of the British Empire. He is the only UK Prime Minister to have been of Jewish birth.', 'title': 'Benjamin Disraeli'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Andrei Ivanovich Gorchakov (1768 – 1855) led a Russian infantry corps in the German Campaign of 1813 and the French Campaign of 1814 during the Napoleonic Wars. He participated in the 1799 Italian and Swiss expedition on the staff of his uncle Alexander Suvorov and was at Cassano, the Trebbia and Novi. In 1812 he fought at Smolensk and Borodino. At Bautzen in May 1813 he led the second line of the Right Wing. He commanded the 1st Infantry Corps, at Dresden and Leipzig in 1813 and at Bar-sur-Aube, Laubressel and Paris in 1814.', 'title': 'Andrei Ivanovich Gorchakov'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Admiral of the Fleet Sir Lucius Curtis, 2nd Baronet, KCB, DL (3 June 1786 – 14 January 1869) was a senior officer of the Royal Navy during the nineteenth century. The son of Sir Roger Curtis, 1st Baronet, Lord Howe\'s flag captain at the Glorious First of June, Lucius served during the Napoleonic Wars and was heavily involved in the Mauritius campaign of 1810. During this campaign, Curtis commanded the frigate HMS "Magicienne" with the blockade squadron under Josias Rowley and was still in command when the ship was destroyed at the Battle of Grand Port. "Magicienne" grounded on a coral reef early in the engagement and despite the best efforts of Curtis and his crew, the ship had to be abandoned, Curtis setting her on fire to prevent her subsequent capture.', 'title': 'Lucius Curtis'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "The Battle of Dresden (26–27 August 1813) was a major engagement of the Napoleonic Wars. The battle took place around the city of Dresden in modern-day Germany. With the recent addition of Austria, the Sixth Coalition felt emboldened in their quest to kick the French out of Central Europe. Despite being heavily outnumbered, French forces under Napoleon scored a modest victory against the Allied army led by Field Marshal Schwarzenberg. However, Napoleon's victory did not lead to the collapse of the coalition, and the lack of effective French cavalry units precluded a major pursuit. A few days after the battle, the Allies surrounded and captured a French corps at the Battle of Kulm.", 'title': 'Battle of Dresden'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'HMS "Cleopatra" was a 32-gun "Amazon"-class fifth rate frigate of the Royal Navy. She had a long career, seeing service during the Fourth Anglo-Dutch War, and the French Revolutionary and Napoleonic Wars. During the latter wars she fought two notable engagements with larger French opponents. In the first engagement she was forced to surrender, but succeeded in damaging the French ship so badly that she was captured several days later, while the "Cleopatra" was retaken. In the second she forced the surrender of a 40-gun frigate. After serving under several notable commanders she was broken up towards the end of the Napoleonic Wars.', 'title': 'HMS Cleopatra (1779)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The IV Cavalry Corps (Grande Armée) was a French military formation that existed during the Napoleonic Wars. The corps was created in 1812 and rebuilt in 1813 and 1815. Emperor Napoleon first organized the corps for the French invasion of Russia. Under General of Division Victor de Fay de La Tour-Maubourg, the corps fought at Borodino. During the War of the Sixth Coalition in 1813, General of Division François Étienne de Kellermann commanded the all-Polish corps at Leipzig. During the Hundred Days in 1815, Napoleon reconstituted the corps and nominated General of Division Édouard Jean Baptiste Milhaud to direct it. Composed entirely of cuirassier regiments, the two divisions fought at Ligny and Waterloo.', 'title': 'IV Cavalry Corps (Grande Armée)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The III Cavalry Corps (Grande Armée) was a French military formation that fought during the Napoleonic Wars. The corps was created in 1812 and reconstituted in 1813 and 1815. Emperor Napoleon first mobilized the corps for the French invasion of Russia. Commanded by General of Division Emmanuel Grouchy, two divisions of the corps fought at Borodino, Tarutino, and Vyazma. A third division fought at First and Second Polotsk and the Berezina. During the War of the Sixth Coalition in 1813, General of Division Jean-Toussaint Arrighi de Casanova led the corps at Grossbeeren, Dennewitz, Leipzig, and Hanau. During the Hundred Days in 1815, Napoleon reorganized the corps and appointed General of Division François Étienne de Kellermann to lead it. One brigade of the corps was engaged at Quatre Bras and both divisions fought at Waterloo.', 'title': 'III Cavalry Corps (Grande Armée)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Sir George Ralph Collier, 1st Baronet KCB (1774 – 24 March 1824) was an officer of the Royal Navy during the French Revolutionary and Napoleonic Wars, and the War of 1812. He had an eventful early life, being shipwrecked early in his career and later captured by the French. Nevertheless, he saw enough service to attract the attention of powerful patrons that secured his rise through the ranks. An officer of considerable ability, he won a noteworthy victory against a stronger French opponent, before embarking on a period of distinguished service off the Spanish and Portuguese coasts, working closely with the British generals fighting the Peninsular War, and markedly contributing to their success. His good service led to a prime posting in command of a squadron despatched to hunt down and neutralise the American super frigates during the War of 1812. He came close to capturing the  , but lost her in circumstances that were unclear and would later return to haunt him. The years of peace that followed the end of the Napoleonic Wars saw him rewarded with a baronetcy, and his continued to serve in the navy where he was tasked with the suppression of the slave trade. The publishing of William James\'s account of the War of 1812, which lambasted him for incompetence and cowardice in his failure to catch the "Constitution", broke his personal peace. Having failed to clear his name, and increasingly depressed by the accusations, Collier took his own life.', 'title': 'Sir George Collier, 1st Baronet'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'HMS "Cherub" was an 18-gun Royal Navy "Cormorant"-class sloop built in Dover in 1806. She participated in two major campaigns in the West Indies during the Napoleonic Wars, and one major engagement in the Pacific during the War of 1812, all each of which earned her crews clasps to the Naval General Service Medal. The Navy sold her in 1820.', 'title': 'HMS Cherub (1806)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Paul von Radivojevich (1759 – 15 July 1829) became an army corps commander in the army of the Austrian Empire during the late Napoleonic Wars. He joined the army of the Habsburg Monarchy in 1782 and fought in one of the early battles of the French Revolutionary Wars. He led a Grenz Infantry Regiment before being promoted to general officer in 1807. He led a brigade at Eckmühl in 1809, a division in the summer of 1813, and a corps at Caldiero in 1813 and at the Mincio in 1814. During the 1815 Italian campaign, he led a corps in Switzerland, Piedmont, and France. After the wars, he commanded part of the Military Frontier. He was Proprietor (Inhaber) of an infantry regiment from 1815 until his death in 1829.', 'title': 'Paul von Radivojevich'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The VI Corps of the "Grande Armée" was the name of a French military unit that existed during the Napoleonic Wars. It was formed at the Camp de Boulogne and assigned to Marshal Michel Ney. From 1805 through 1811, the army corps fought under Ney\'s command in the War of the Third Coalition, the War of the Fourth Coalition, and the Peninsular War. Jean Gabriel Marchand was in charge of the corps for a period when Ney went on leave. In early 1811, Ney was dismissed by Marshal André Masséna for disobedience and the corps was briefly led by Louis Henri Loison until the corps was dissolved in May 1811. The VI Corps was revived in 1812 for the French invasion of Russia and placed under Laurent Gouvion Saint-Cyr. It entirely consisted of Bavarian soldiers at that time. After the disastrous winter retreat the corps was virtually destroyed. In 1813 during the War of the Sixth Coalition it was recreated with reorganized French troops. Marshal Auguste Marmont took command of the corps and managed it until Emperor Napoleon\'s abdication in 1814. It took part in many battles including Dresden and Leipzig in 1813. During the Hundred Days, Georges Mouton, Count de Lobau commanded the VI Corps at the Battle of Waterloo.', 'title': 'VI Corps (Grande Armée)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Will Jacobs (born 1955) is an American comics and humor writer. He was a coauthor with Gerard Jones on "The Beaver Papers", "The Comic Book Heroes", and the comic book "The Trouble with Girls" (1987–1993). He was a contributor to "National Lampoon magazine" and various DC Comics. Jacobs left professional writing in the 1990s to start a used and antiquarian book service, Avalon Books. He co-wrote with Jones "The Comic Book Heroes", a book dedicated to the history of the American comic book industry from the Silver Age to the present.', 'title': 'Will Jacobs'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Crossed is a comic book written by Garth Ennis and drawn by Jacen Burrows for the first ten issues, and published by Avatar Press. Following volumes "Crossed: Family Values", "Crossed 3D", and "Crossed: Psychopath" were written by David Lapham. A new series, "Crossed: Badlands" is written and drawn by rotating creative teams. The franchise has also spawned two webcomics: "Crossed: Wish You Were Here", which ran from 2012–2014, and "Crossed: Dead or Alive", which began syndication in November 2014.', 'title': 'Crossed (comics)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'A comic book or comicbook, also called comic magazine or simply comic, is a publication that consists of comic art in the form of sequential juxtaposed panels that represent individual scenes. Panels are often accompanied by brief descriptive prose and written narrative, usually dialog contained in word balloons emblematic of the comics art form. Although comics has some origins in 18th century Japan and 1830s Europe, comic books were first popularized in the United States during the 1930s. The first modern comic book, "Famous Funnies", was released in the United States in 1933 and was a reprinting of earlier newspaper humor comic strips, which had established many of the story-telling devices used in comics. The term "comic book" derives from American comic books once being a compilation of comic strips of a humorous tone; however, this practice was replaced by featuring stories of all genres, usually not humorous in tone.', 'title': 'Comic book'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Garth Ennis (born 16 January 1970) is a Northern Irish-born naturalized American comics writer, best known for the Vertigo series "Preacher" with artist Steve Dillon and his successful nine-year run on Marvel Comics\' Punisher franchise. He has collaborated with artists such as Dillon and Glenn Fabry on "Preacher", John McCrea on "Hitman", and Carlos Ezquerra on both "Preacher" and "Hitman".', 'title': 'Garth Ennis'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Nunzio DeFilippis is an American writer of comic books and television. He writes with his wife, Christina Weir, whom he met while they were both students at Vassar College. The two have written for two seasons on HBO\'s "Arli$$", and have sold story ideas to the Disney Channel\'s "Kim Possible". In comics, they have written several graphic novels and miniseries for independent publisher Oni Press, including "Skinwalker, Three Strikes, Maria\'s Wedding, The Tomb, Once In A Blue Moon" the Amy Devlin Mysteries, Frenemy Of The State (written with Rashida Jones), and Bad Medicine. Their work at Oni led to work at Marvel Comics, relaunching the teen mutant book "New Mutants". This book was renamed "". Their run on these books spanned three years and created almost two dozen new super-powered mutant characters for Marvel\'s X-Men franchise, including Surge, Hellion, Wind Dancer, Prodigy, Wallflower, Elixir, Tag, Rockslide, Mercury, Anole, and Wither. They have also written for DC Comics, with stories appearing in "Wonder Woman, Adventures of Superman" and "Batman Confidential" and Dark Horse with "Dragon Age: Knight Errant." The duo also work in the expanding field of Japanese manga, providing English adaptations for the Del Rey titles "Guru-Guru Pon-Chan, Sugar Sugar Rune" and "Kagetora". They also write original English language manga for Seven Seas Entertainment, writing one of the company\'s launch titles, "Amazing Agent Luna" and the pirate manga, "Destiny\'s Hand". DeFilippis also wrote, without his wife, an issue of DC Comics\' "Detective Comics". He taught comic writing at UCLA Extension before teaching screenwriting and comic book writing at the Los Angeles branch of the New York Film Academy, where he is now Chair of the Screenwriting Department and Dean of Faculty.', 'title': 'Nunzio DeFilippis'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'A comic book convention or comic con is an event with a primary focus on comic books and comic book culture, in which comic book fans gather to meet creators, experts, and each other. Commonly, comic conventions are multi-day events hosted at convention centers, hotels, or college campuses. They feature a wide variety of activities and panels, with a larger number of attendees participating in cosplay than most other types of fan conventions. Comic book conventions are also used as a vehicle for industry, in which publishers, distributors, and retailers represent their comic-related releases. Comic book conventions may be considered derivatives of science-fiction conventions, which began in the late 1930s.', 'title': 'Comic book convention'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Metropolis Collectibles is a famous rare comic book dealer of vintage American comics, primarily known for its large collection of comic books originally published in the 1930s, 1940s, 1950s, 1960s and 1970s. Metropolis was founded in 1984 by Stephen Fishler, and merged companies in 1999 with Vincent Zurzolo, Jr., of Vincent\'s Collectibles.; Zurzolo said that as he found he could not compete with Fishler\'s business, merging the two made sense. The company is located on Broadway in New York City, and the comic book showroom allows viewings by appointment only. Over the years, Metropolis Collectibles has grown from being a comic-book mail-order company to maintaining a major online retail presence. In addition to being comic book buyers and comic book sellers, Metropolis also gives comic book appraisals and provides comic book valuation services of rare, old out-of-print comics. Metropolis Collectibles has obtained a variety of notable classic comic book collections over the years, or "pedigrees", including the Crowley Collection, the Allentown Pedigree, the D-Copy Collection, and the Northford Collection. In August 2014, the company was able to purchase a near-mint copy of "Action Comics #1" (CGC 9.0) for $3.2 million in an auction on eBay.', 'title': 'Metropolis Collectibles'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Glenn Greenberg (b. in New York City) is an American comic book and fiction writer. At the beginning of his career, he became a regular Marvel Comics writer, penning stories for "The Spectacular Spider-Man", "The Rampaging Hulk", "The Silver Surfer", and "Dracula". He has also written articles for comic book magazines such as "Back Issue! ".', 'title': 'Glenn Greenberg'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Star Crossed, is a three-issue comic book mini-series published in 1997 under the short-lived DC Comics imprint, Helix. Written and illustrated by Matt Howarth, "Star Crossed" recounts the surrealist tale of a deep-space romance between a genetically engineered über-woman and a sentient asteroid. Consistent with the performance of other Helix titles, "Star Crossed" failed to appeal to a broad readership and the poor sales figures which accompanied its publication coincided with a general downturn in the American comic book industry.', 'title': 'Star Crossed (comics)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'A comics artist (also comic book artist or graphic novel artist, comic book producer, comic book illustrator, comic book writer, and comic book author) is a person working within the comics medium on comic strips, comic books, or graphic novels. The term may refer to any number of artists who contribute to produce a work in the comics form, from those who oversee all aspects of the work to those who contribute only a part.', 'title': 'Comics artist'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Manning Marius Kimmel (also known as Marius Manning Kimmel, October 25, 1832 – February 27, 1916) was a military officer who served on both sides of the American Civil War. He entered the United States Military Academy at West Point in 1853 and graduated in 1857. After initially fighting for the Union, he switched sides to the Confederacy, one of four West Point graduates to fight on both sides during the war. In the Confederate Army, he served as adjutant general and assistant adjutant general on the staff of generals Benjamin McCulloch and Earl Van Dorn, and as inspector general on John Magruder's staff. He was the father of Admiral Husband E. Kimmel, who commanded the United States Pacific Fleet during the Attack on Pearl Harbor.", 'title': 'Manning M. Kimmel'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Cornelis Johannes Marius Nagtglas (16 May 1814\xa0– 19 January 1897) was a Dutch politician and civil servant, who made a career in the administration on the Dutch Gold Coast. After originally beginning his career at the rather advanced age of 36, he was promoted through the ranks to eventually become Governor of the Dutch Gold Coast in 1858. He retired to the Netherlands in 1862, but returned to the Gold Coast as governor in 1869, to restore order in the embattled colony. In 1871, he left the Gold Coast again, one year before the transfer of the colony to the United Kingdom.', 'title': 'Cornelis Nagtglas'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Claudius Xenophon (or Xenephon) was a governor of Britannia Inferior, a province of Roman Britain around AD 223. He is named on two milestones with nearly identical texts, which can be dated to that year. He succeeded Marius Valerianus, whose rule is attested in AD 222; and his governorship must have ended by AD 225, when another governor is mentioned in a fragmentary inscription, which only provides part of the name (Maximus). He is also mentioned in inscriptions in Vindolanda and perhaps at Chesters. His father is thought to be a T. Cl(audius) T. f(ilius) Papiria Xenophon, who is mentioned in inscriptions and papyri in various procuratorships in Egypt and Dacia under Commodus.', 'title': 'Claudius Xenophon'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Appius Claudius Pulcher (c. 139 BC – 76 BC) was a Roman politician of the 1st century BC. There is uncertainty about who his father was. It was most probably the Appius Claudius Pulcher who was consul in 143 BC. He was a supporter of Lucius Cornelius Sulla and served as praetor in 88 BC. He was exiled in that year by Gaius Marius while Sulla was away in the east. He returned to Rome after Lucius Cornelius Cinna died in 84 BC, and served as consul in 79 BC and as governor of Roman Macedonia from 78 BC to 76 BC.', 'title': 'Appius Claudius Pulcher (consul 79 BC)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Husband Edward Kimmel (February 26, 1882 – May 14, 1968), nicknamed "Kim", was an admiral in the United States Navy. At the time of the Japanese attack on Pearl Harbor, he was Commander in Chief of the United States Fleet (CINCUS) and the U.S. Pacific Fleet (CINCPACFLT). He was removed from command after the December 1941 attack and reduced from four-star to the two-star rank of rear admiral. He retired from the Navy in early 1942.', 'title': 'Husband E. Kimmel'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Fame at the Mansion was an exclusive black tie event held February 12, 2012, at the Los Angeles Playboy Mansion on the evening of the 54th Grammy Awards. The event, hosted by Grammy Award winner Sean Combs, featured an honorary ceremony for Playboy\'s founding father Hugh Hefner and was a media heavy fundraiser for the Angelwish Foundation, which supports children and families with chronic illness. Hefner was honored as a Humanitarian of the Year by the Angelwish Foundation. Following the event, Diddy was featured on "Jimmy Kimmel Live! ", and was quoted as saying that it was the "best party he has ever thrown."', 'title': 'Fame at the Mansion'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Marius Kohl (born 16 September 1953) is the former chief of the Luxembourg tax agency "Sociétés 6". During his 22-year tenure, he was solely responsible for approving thousands of tax arrangements for foreign companies investing capital in Luxembourg. He retired in 2013. Kohl was known by the nickname "Monsieur Ruling" and', 'title': 'Marius Kohl'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Stephen Manning Speakes (born May 21, 1952) is a retired Lieutenant General now serving as the President and CEO of Kalmar Rough Terrain Center (KRTC), LLC. The company makes rough terrain material handling equipment for the Military and Commercial markets. KRTC is located in Cibolo, Texas on the outskirts of San Antonio. As the CEO since 2013 Steve has focused on emphasizing customer relationships, expanding into the commercial marketplace while improving quality and efficiency. The company\'s signature product is the Rough Terrain Container Handler (RTCH) famous to Soldiers and Marines across Iraq, Afghanistan and Kuwait as the only piece of equipment capable of moving 20 and 40 foot containers "the last tactical mile" to the troops. Prior to joining KRTC, Steve was an executive vice president at USAA from 2010-2013 responsible for enterprise strategy, and external affairs. Steve\'s final assignment in a 35-year Army career was as the Deputy Chief of Staff G-8 Programs for The United States Army. In that role Speakes was responsible for developing and presenting the Army\'s financial strategy to the Executive Branch and to Congress. He was also charged with equipping the Army during a time of wartime operations when demand for new force protection capabilities required innovative and adaptive solutions. Previously, Steve served in a wide variety of command and staff assignments in the US, Germany, Iraq and Kuwait. He is married to Judy, a retired physician assistant, and also a proud father.', 'title': 'Stephen M. Speakes'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Mario von Bucovich (1884-1944) was also known as Marius von Bucovich. He was born at Pula in the Istrian region of the Austro-Hungarian Empire and held the title of Baron. His father, August, Freiherr von Bucovich, was a former Corvette Captain in the Austro-Hungarian navy and later an entrepreneur in the railroad concession sector. Mario von Bucovich's wife, Marie, was also a photographer.", 'title': 'Mario von Bucovich'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Manning Marius Kimmel (April 22, 1913 - on or around July 26, 1944) was a United States Navy submarine officer in World War II and the son of Admiral Husband E. Kimmel. He served as both junior and Executive Officer on several submarines, and finally assumed command of USS "Robalo" as a Lieutenant Commander. Kimmel was reportedly killed when "Robalo" was sunk off the island of Palawan. However, the specific circumstances surrounding his death remain unclear.', 'title': 'Manning Kimmel'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Three Piece Reclining Figure: Draped 1975 is a bronze sculpture by Henry Moore, catalogued as LH 655. It is approximately 4.7m long. Seven casts and an artists proof were made. Three publicly exhibited casts are situated in the Sodra Kungsgatan in Gävle, Sweden at the Massachusetts Institute of Technology in Boston, USA, and at the Henry Moore Foundation in Perry Green, Hertfordshire.', 'title': 'Three-Piece Reclining Figure: Draped 1975'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Man Enters the Cosmos is a cast bronze sculpture by Henry Moore located on the Lake Michigan lakefront outside the Adler Planetarium in the Museum Campus area of downtown Chicago in Cook County, Illinois, United States. The planetarium, which is both a National Historic Landmark and listed on the National Register of Historic Places, is located in the Near South Side community area of Chicago. Moore\'s sculpture is a functional bowstring equatorial sundial created in 1980 measuring approximately 13 ft . The sundial was formerly located slightly further south at the steps of the main entry plaza to the Planetarium, but it now sits directly on the lakefront. The work is a later copy of a composition first created in the 1960s for the offices of "The Times" newspaper at Printing House Square in London, and according to the Henry Moore Foundation is titled Sundial 1965–66.', 'title': 'Man Enters the Cosmos'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'John Wesley Work Jr. (August 6, 1871 - September 7, 1925) was the first African-American collector of folk songs and spirituals, and also a choral director, educationalist and songwriter. He is now sometimes known as John Wesley Work II, to distinguish him from his son, John Wesley Work III.', 'title': 'John Wesley Work Jr.'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'John Wesley ( or ; 28 June\xa0[O.S. 17 June]\xa01703 2 March 1791) was an English Anglican cleric and theologian who, with his brother Charles and fellow cleric George Whitefield, founded Methodism.', 'title': 'John Wesley'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Wesley's Chapel is a Methodist church in London that was built under the direction of John Wesley, the founder of the Methodist movement. It is now a place of worship and visitor attraction, incorporating the Museum of Methodism in its crypt and John Wesley's House next to the chapel.", 'title': "Wesley's Chapel"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "John Wesley, also known as Wes Dearth (born John Wesley Dearth, III in June 1962) is an American singer, songwriter and guitar player. John Wesley's professional music career began in the early 1980s in the Tampa, Florida area where he founded 1991 Southwestern Music Conference's showcase act Autodrive along with drummer/producer Mark Prator. The following year, Wesley embarked on a solo career and became the opening act for British rockers Marillion on seven consecutive tour legs around the world, especially North and South America, the UK and Europe.", 'title': 'John Wesley (guitarist)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Manchester and Salford Wesleyan Methodist Mission was set up in 1886 in Greater Manchester, North West England. The Central Hall building on Oldham Street became the head office for the mission. Before Central Hall was built, there was a previous chapel (called the Oldham Street Chapel), which was opened by John Wesley in 1781. John Wesley and his brother Charles Wesley were the founders of Methodism in England in 1729; the Manchester and Salford Wesleyan mission was named after them, as were many other missions (and missionaries). There were “numerous and flourishing voluntary societies to combat vice, and religious societies to enlighten the faithful”; the society set up by the Wesley brothers in Oxford in 1729 was “to prove that the decline of the religious spirit had been exaggerated”. When the chapel in Oldham Street was demolished, it was replaced by the Methodist Central Hall (which housed the Manchester and Salford Wesleyan Mission).', 'title': 'Manchester and Salford Wesleyan Methodist Mission'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Henry Moore (1751–1844) was an English Wesleyan minister and biographer.', 'title': 'Henry Moore (biographer)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Sheep Piece is a sculpture by Henry Moore made in three sizes from 1969-1972, starting in 1969 with a 14 cm maquette (LH 625) modelled in plaster and then cast in bronze, enlarged in 1971 to a 142 cm working model (LH 626) in plaster and then cast in bronze, and finally a full size bronze (LH 627) on a monumental scale, 570 cm high, cast in 1971-72. The four full-size casts are at the Henry Moore Foundation in Perry Green, Hertfordshire, in Zürich, in Kansas City, and at the Donald M. Kendall Sculpture Gardens in Purchase, New York.', 'title': 'Sheep Piece 1971–72'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Henry Moore Foundation is a registered charity in England, established for education and promotion of the fine arts — in particular, to advance understanding of the works of Henry Moore. The charity was set up with a gift from the artist in 1977. The Foundation supports a wide range of projects, including student bursaries, fellowships for artists and financial grants to various arts institutions. It operates from Perry Green in Hertfordshire and at the Henry Moore Institute in Leeds, England.', 'title': 'Henry Moore Foundation'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Greenwich Avenue Historic District is a historic district representing the commercial and civic historical development of the downtown area of the town of Greenwich, Connecticut. The district was listed on the National Register of Historic Places on August 31, 1989. Included in the district is the Greenwich Municipal Center Historic District, which was listed on the National Register the year before for the classical revival style municipal buildings in the core of Downtown. Most of the commercial buildings in the district fall into three broad styles, reflecting the period in which they were built: Italianate (late 19th century), Georgian Revival (early 20th century), and Commercial style (after World War I). The district is linear and runs north-south along the entire length of Greenwich Avenue, the main thoroughfare of Downtown Greenwich, between U.S. Route 1 and the New Haven Line railroad tracks.', 'title': 'Greenwich Avenue Historic District'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Avery Street Historic District, is a national historic district located at Parkersburg, Wood County, West Virginia. It is to the east of the Julia-Ann Square Historic District and south of the Parkersburg High School-Washington Avenue Historic District. Primarily residential, it encompasses 109 acres and includes churches, a school, and a small commercial area. Built as Parkersburg\'s first "suburb" in the late-19th and early-20th century in popular architectural style such as Colonial Revival and Queen Anne, the district exhibits 12 distinctive types of Historic architecture. There are 358 contributing buildings, 59 of which are considered to be pivotal. U.S. Senator Johnson N. Camden (1826-1908) owned most of the land now included in the district. Located in the district are the separately listed Parkersburg Women\'s Club and the First Presbyterian Church/Calvary Temple Evangelical Church.', 'title': 'Avery Street Historic District'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Ticonderoga is a town in Essex County, New York, United States. The population was 5,042 at the 2010 census. The name comes from the Mohawk "tekontaró:ken", meaning "it is at the junction of two waterways".', 'title': 'Ticonderoga, New York'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Lake George Battlefield Park Historic District is a national historic district relating to the French and Indian War Battle of Lake George and located near Lake George in Warren County, New York. The parkland was purchased and developed by New York State between 1896 and 1965. It encompasses numerous significant archaeological sites related to a series of conflicts dated from about 1755 to 1814. The archaeological sites include those related to Fort George (1759), earthen trenches (1757-1758), and barracks and hospitals dated to the 1750s. The historic districts also includes a number of plaques and monuments including those commemorating Henry Knox (1925), the Bloody Morning Scout (1935), and Fr. Isaac Jogues (1939). Other contributing features relate to the property's development as a park and include the battlefield park and battlefield campground, Fort George Road, the Delaware and Hudson Railway right of way (c. 1880), the Dowling Farmhouse (c. 1870), and the maintenance complex (c. 1890-c. 1920s).", 'title': 'Lake George Battlefield Park Historic District'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Lake George Avenue Historic District is a national historic district located at Ticonderoga, in Essex County, New York. The district contains 20 contributing buildings on 14 properties; 12 houses and eight garages. It includes single-family homes built between 1919 and 1921 by W.A. Gale for the Ticonderoga Pulp and Paper Company as rental properties for company management. The houses share a common American Craftsman influenced bungalow style. Gale also constructed the houses in the Amherst Avenue Historic District.', 'title': 'Lake George Avenue Historic District'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The West Garrison Avenue Historic District is a historic district encompassing the oldest commercial section of Fort Smith, Arkansas. When listed on the National Register of Historic Places in 1979, the district included just a five-block stretch of Garrison Avenue, the major east-west thoroughfare in the city and one its oldest, dating to the city\'s founding in 1838. The district included more than fifty historically significant buildings built before 1912. The area was significantly affected by a major tornado in September 1996, in which thirteen historic buildings were destroyed and others damaged. The district was subsequently enlarged in 2001 to encompass 175 buildings with historic significance to 1951. These buildings are located along the length of Garrison Avenue (twelve blocks), as well as Rogers Avenue and North "A" Street, which run parallel to Garrison (north and south of it, respectively), and the connecting north-south blocks.', 'title': 'West Garrison Avenue Historic District'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Amherst Avenue Historic District is a national historic district located at Ticonderoga, in Essex County, New York. The district contains 16 contributing buildings on ten properties; 10 houses and six garages. It includes single-family homes built between 1921 and 1923 by W.A. Gale for the Ticonderoga Pulp and Paper Company as rental properties for company management. Gale also constructed the houses in the Lake George Avenue Historic District.', 'title': 'Amherst Avenue Historic District'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Harvard Avenue Historic District is a historic district roughly bounded by Linden Street, Commonwealth Avenue, Harvard Avenue, and Park Vale Avenue in the Allston neighborhood of Boston, Massachusetts. Its spine is Harvard Avenue, a major north-south thoroughfare connecting Allston to points north (generally via Cambridge Street toward Cambridge), and south toward Brookline. The area underwent a population explosion in the early 20th century, and Harvard Avenue was developed roughly between 1905 and 1925 as a commercial and residential spine. Notable buildings in the district include the Allston Station building, designed by Shepley, Rutan and Coolidge, and the Harvard Avenue Fire Station.', 'title': 'Harvard Avenue Historic District'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Boston–Edison Historic District is a historic neighborhood located in the geographic center of Detroit, Michigan. It consists of over 900 homes built on four east/west streets: West Boston Boulevard, Chicago Boulevard, Longfellow Avenue, and Edison Avenue, stretching from Woodward Avenue on the east to Linwood Avenue on the west. It is one of the largest residential historic districts in the nation. It is surrounded by Sacred Heart Major Seminary to the west, the Arden Park-East Boston Historic District and the Cathedral of the Most Blessed Sacrament to the east, and the Atkinson Avenue Historic District to the south. The district was designated a Michigan State Historic Site in 1973 and listed on the National Register of Historic Places in 1975.', 'title': 'Boston–Edison Historic District'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The Swiss Avenue Historic District is a residential neighborhood in East Dallas, Dallas, Texas (USA). It consists of installations of the Munger Place addition, one of East Dallas' early subdivisions. The Swiss Avenue Historic District is a historic district of the city of Dallas, Texas. The boundaries of the district comprise both sides of Swiss Avenue from Fitzhugh Steet, to just north of La Vista, and includes portions of Bryan Parkway. The District includes the 6100-6200 blocks of La Vista Drive, the west side of the 5500 block of Bryan Parkway the 6100-6300 blocks of Bryan Parkway, the east side of the 5200-5300 block of Live Oak Street, and the 4900-6100 blocks of Swiss Avenue. The entire street of Swiss Avenue is not included within the bounds of the Swiss Avenue Historic District. Portions of the street run through Dallas' Peaks Suburban Addition neighborhood and Peak's Suburban Addition Historic District.", 'title': 'Swiss Avenue Historic District'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The American Jewish Year Book (AJYB) has been published since 1899. Publication was initiated by the Jewish Publication Society (JPS). In 1908, the American Jewish Committee (AJC) assumed responsibility for compilation and editing while JPS remained the publisher. From 1950 through 1993, the two organizations were co-publishers, and from 1994 to 2008 AJC became the sole publisher. From 2012 to the present, Springer has published the "Year Book" as an academic publication. The book is published in cooperation with the Berman Jewish DataBank and the Association for the Social Scientific Study of Jewry.', 'title': 'American Jewish Year Book'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Publication bias is a type of bias that occurs in published academic research. It occurs when the outcome of an experiment or research study influences the decision whether to publish or otherwise distribute it. Publication bias matters because literature reviews regarding support for a hypothesis can be biased if the original literature is contaminated by publication bias. Publishing only results that show a significant finding disturbs the balance of findings.', 'title': 'Publication bias'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Báiki: The International Sámi Journal ("Báiki" means place in Sami) is a biannual English-language publication that covers Sami culture, history, and current affairs. The coverage also includes the community affairs of the Sami in North America, estimated at some 30,000 people.', 'title': 'Báiki'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Mainz Psalter was the second major book printed with movable type in the West; the first was the Gutenberg Bible. It is a psalter commissioned by the Mainz archbishop in 1457. The Psalter introduced several innovations: it was the first book to feature a printed date of publication, a printed colophon, two sizes of type, printed decorative initials, and the first to be printed in three colours. The colophon also contains the first example of a printer's mark. It was the first important publication issued by Johann Fust and Peter Schoeffer following their split from Johannes Gutenberg.", 'title': 'Mainz Psalter'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Morning Chronicle was a newspaper founded in 1769 in London, England, and published under various owners until 1862, when its publication was suspended, with two subsequent attempts at continued publication. From 28 June 1769 to March 1789 it was published under the name "The Morning Chronicle, and London Advertiser". From 1789 to its final publication in 1865, it was published under the name "The Morning Chronicle". It was notable for having been the first steady employer of essayist William Hazlitt as a political reporter, and the first steady employer of Charles Dickens as a journalist; for publishing the articles by Henry Mayhew that were collected and published in book format in 1851 as "London Labour and the London Poor"; and for publishing other major writers, such as John Stuart Mill.', 'title': 'The Morning Chronicle'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Pittosporum kirkii is a glabrous evergreen perennial shrub that reaches up to 5 m in height and possesses distinctive coriaceous, fleshy, thick leaves. It is one of four shrubs endemic to New Zealand that frequently displays an epiphytic lifestyle. "P. kirkii" is commonly epiphytic, perched amongst nest epiphytes in the canopies of emergent or canopy trees in old-growth forest; however, it can be observed occasionally growing on the ground or over rocks (in a rupestral lifestyle). The type locality of "P. kirkii" is Great Barrier Island. It was first described by Joseph Dalton Hooker from material collected by Thomas Kirk, published in 1869. The initial brief description titled "Pittosporum n. sp. ?" by Thomas Kirk was published in his paper on Great Barrier Island in 1868. This description along with herbarium specimens were sent to Dr. J. D Hooker at Kew Gardens in 1868, and he collaborated to name it after T. Kirk, by giving it the specific epithet "kirkii" within the publication that was otherwise written by Kirk.', 'title': 'Pittosporum kirkii'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Sick was a satirical-humor magazine published from 1960 to 1980, lasting 134 issues.', 'title': 'Sick (magazine)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Agricultural Museum was the first agricultural periodical magazine published in the United States, first printed July 4, 1810. <ref name ="Kane/Barnett"> Kane, p. 13: "The first agricultural journal was the "Agricultural Museum", a sixteen-page octavo issued July 4, 1810, under the sponsorship of the Columbian Agricultural Society. It was edited by Rev. David Wiley and printed by W. A. Rind at Georgetown, B.C. The first volume was semi-monthly, but beginning with volume two it was issued monthly. Subscription was $2.50 for 24 numbers. Publication ceased May 1812. (Agricultural History. April 1928. Vol. 2 No. 2, pp. 99-102 "In the references to the history of the agricultural literature of the United States, The American Farmer, the first number of which was published in Baltimore on April 2, 1819, is quite generally given the honor of being the first agricultural periodical published in the United States. It is without doubt rightfully considered the great precursor of our present agricultural periodical press, but there was another little known agricultural periodical which actually preceded The American Farmer by nearly nine years and which, it is believed, is entitled to the distinction of being the first agricultural journal published in this country. The name of it was The Agricultural Museum, and the first number appeared on July 4, 1810. Its place of publication was Georgetown in the District of Columbia, or "George- town, Ca." as it is given on the publication. It was printed by W. A. Rind. The editor of the periodical was Rev. David Wiley.")" </ref>', 'title': 'Agricultural Museum (periodical)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Top Pops" is a former British weekly pop music newspaper. It was founded as a monthly publication by Woodrow Wyatt in May 1967, becoming fortnightly in November 1967. On 25 May 1968, editor Colin Bostock-Smith began compiling a singles sales chart using a telephone sample of approximately twelve W H Smith & Son stores – the first single to reach number one on the "Top Pops" chart was "Young Girl" by Gary Puckett & The Union Gap. The charts and paper were published weekly with effect from 22 June 1968. On 20 September 1969 the paper was rebranded "Top Pops & Music Now", and subsequently became "Music Now" from 21 March 1970 – at this point the chart was sampling between 30 and 40 stores. From 27 February 1971 the chart was no longer published and in May 1971 the newspaper ceased publication. During the publication of the chart, 55 different singles reached number one. The only one to be knocked off number one and then regain the top spot was "Mony Mony" by Tommy James and the Shondells. The final chart-topper was "My Sweet Lord" by George Harrison.', 'title': 'List of Top Pops number-one singles'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Type 346 radar is a highly digitized, multi-function, dual-band (S and C bands) naval active phased array radar (APAR) installed on Type 052C destroyers, Type 052D destroyers and Type 055 destroyers of the PLAN. The radar is named as the Star of the Sea (Hai-Zhi-Xing, 海之星) by its developer and it is one of the two competitors for PLAN’s SAPARS (Shipborne Active Phased Array Radar System) project/program. Due to its secrecy and lack of information, Type 346 radar has been frequently but erroneously confused with a Chinese fire control radar Type 348, and mistakenly identified as Type 348 by many sources. Furthermore, it is also frequently confused with and misidentified as Sea Lion series C-band phased array radars developed by another design house.', 'title': 'Type 346 Radar'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Davies made his 2nd XI debut for Glamorgan vs MCC young cricketers and has to date made over 25 appearances for the county. He later made his Test Match debut for Wales Minor Counties against Lincolnshire in the 2009 MCCA Knockout Trophy. His Minor Counties Championship debut came in the same season against Shropshire. To date he has made fourteen Minor Counties Championship and ten MCCA Knockout Trophy appearances. While studying for a degree in Sports Coaching at the University of Wales Institute, Cardiff, Davies made his debut in first-class cricket for Cardiff MCCU against Somerset in 2012 at Taunton Vale Sports Club Ground, making scores of 42 and 14.', 'title': 'Sam Davies (cricketer)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'These were the eleven squads (all Test nations and two ODI nations) picked to take part in the 2000 ICC KnockOut Trophy, the second installment of the Champions Trophy cricket tournament. The tournament was held in Kenya from 3 to 15 October 2000. In the preliminary quarter finals, two ODI full-status teams Kenya and Zimbabwe played with India and Sri Lanka respectively, and India and Sri Lanka won their matches convincingly. In third preliminary quarter final, England beat Bangladesh to secure his position in Knockout Tournament. New Zealand won the second edition of the ICC KnockOut Trophy by defeating India in the final by four wickets, which was their first ICC event to be won.', 'title': '2000 ICC KnockOut Trophy squads'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Marlon Nathaniel Samuels (born 5 February 1981) is a Jamaican cricketer who plays internationally for the West Indies in all three formats, and a former ODI captain. He is a right-handed middle order batsman and an off-spinner. He was a key member of the West Indies team that won the 2012 ICC World Twenty20 and 2016 ICC World Twenty20, and was named man of the match in the final of both tournaments, becoming first man to achieve the feat.', 'title': 'Marlon Samuels'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Peter William Kingston-Davey (22 October 1940) is a former English cricket umpire from Tiverton, Devon. In 1995, Kingston-Davey first stood as an umpire in a Minor Counties Championship match between Dorset and Wales Minor Counties. Two years later he stood in his first MCCA Knockout Trophy match, played between Dorset and Wales Minor Counties. He stood in his first List A match in the 1999 NatWest Trophy played between Devon and Berkshire. Between 1999 and 2003 he stood in 5 List A matches, the last of which he stood in was between Devon and Suffolk in the 1st round of the 2004 Cheltenham & Gloucester Trophy which was held in 2003. Peter-Kingston stood as an umpire in Minor counties cricket until 2006, by which time he had stood in 39 Minor Counties Championship matches and 15 MCCA Knockout Trophy matches.', 'title': 'Peter Kingston-Davey'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'These were the nine squads (all Test nations) picked to take part in the 1998 ICC KnockOut Trophy, the first installment of the Champions Trophy cricket tournament. The tournament was held in Bangladesh from 24 October to 2 November 1998. Teams could name a preliminary squad of 30, but only 14-man squads were permitted for the actual tournament, one month before the start of the tournament. In the knockout tournament, New Zealand and Zimbabwe were the only teams to play a pre-quarter final match. New Zealand won the match and qualified for the quarter-final where they faced Sri Lanka. South Africa won the inaugural edition of the ICC KnockOut Trophy by defeating West Indies in the final by four wickets.', 'title': '1998 ICC KnockOut Trophy squads'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Guy Philip Randall-Johnson (born 8 December 1959) is a former English cricketer and umpire from Crediton, Devon. Randall-Johnson initially played Minor counties cricket for Devon between 1987 and 1991. In 1993, Randall-Johnson first stood as an umpire in a Minor Counties Championship match between Dorset and Wales Minor Counties. Two years later he stood in his first MCCA Knockout Trophy match, played between Cornwall and Devon. He stood in his first List A match in the 1999 NatWest Trophy played between the Somerset Cricket Board and Bedfordshire. Between 1999 and 2003 he stood in 7 List A matches, the last of which he stood was between Dorset and Buckinghamshire in the 1st round of the 2004 Cheltenham & Gloucester Trophy which was held in 2003. Randall-Johnson stood as an umpire in Minor counties cricket until 2008, by which time he had stood in 54 Minor Counties Championship matches and 25 MCCA Knockout Trophy matches. He made headlines in 2006 for walking out of a Minor Counties Championship match after being on the receiving end of abuse from Berkshire players after he gave Berkshire captain Julian Wood out LBW. After not getting an apology from the players, he walked out of the game, with others having to deputise for him.', 'title': 'Guy Randall-Johnson'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The 1998 ICC KnockOut Trophy (officially known as Wills International Cup, also known as Mini World Cup) was a One Day International (ODI) cricket tournament held in Bangladesh. It was the first tournament apart from the World Cups to involve all Test playing nations. The winners of the Knock-out stage—India, South Africa, Sri Lanka and Indies—reached the semi-finals. South Africa made their way to the final by defeating Sri Lanka in the first semi-final by 92 runs; the match was reduced to 39 overs per innings due to rain. In the second semi-final, West Indies defeated India by six wickets, and qualified for the final.', 'title': '1998 ICC KnockOut Trophy Final'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ray Ricardo Wynter (born 27 November 1955) is a former Jamaican cricketer who played first-class and one-day cricket for Jamaica from 1975 until 1982. A right-handed batsman and right-arm opening bowler, he played 30 matches in all in those formats. In 1983, Wynter participated in a rebel tour of South Africa. As a result, he and all the other players on the tour received a lifetime ban from West Indian cricket. Wynter later emigrated to the United States, and played for the U.S. national team at the 1990 ICC Trophy.', 'title': 'Ray Wynter'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "The 2000 ICC KnockOut Trophy was a One Day International cricket tournament held in Kenya (which helped to booster cricket in Kenya). New Zealand were crowned champions and cashed the winner's cheque of US$250 000. It was their first win in a major ICC tournament. Zaheer Khan, Yuvraj Singh and Marlon Samuels made their ODI debuts during the competition.", 'title': '2000 ICC KnockOut Trophy'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Stafanie Roxann Taylor, OD (born 11 June 1991) is a Jamaican cricketer who is current captain of West Indies women's cricket team. She has represented West Indies women's cricket team over 80 times since her debut in 2008. A right-handed batsman and off break bowler, Taylor was selected as the 2011 ICC Women's Cricketer of the Year – the first West Indian to receive the accolade. Born in Jamaica, Taylor broke into the West Indies team in 2008, aged 17, and immediately inserted herself as a key member of the team. She scored her highest Twenty20 total on debut, striking 90 runs from 49 balls to help her side to a large victory. In the 2016 World Twenty20, she was the highest run-scorer and named player of the series. She played in her 100th Women's One Day International (WODI) match, when the West Indies played India in the group stage of the 2017 Women's Cricket World Cup, on 29 June 2017.", 'title': 'Stafanie Taylor'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Thomas Mann Prize ("German": Thomas-Mann-Preis) is a literary prize of Germany. In full the title is "Thomas Mann Prize of the city of Lübeck and the Bavarian Academy of Fine Arts". It is given in alternate years in Lübeck and in Munich. The award is the product of a merger of two prizes in 2010, the Thomas Mann Preis der Hansestadt Lübeck (Thomas Mann Prize Lübeck) and the Großen Literaturpreis (Great Literature Prize) of the Bavarian Academy of Fine Arts. The Thomas Mann Prize Lübeck was first awarded in 1975; the Great Literature Prize was first awarded in 1950.', 'title': 'Thomas Mann Prize'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Thomas Mann House at 1550 San Remo Drive in Pacific Palisades, Los Angeles, California, was designed by the modernist architect JR Davidson for the exiled German writer Thomas Mann in 1941. Mann lived at the house between 1942 and 1952 before his emigration to Switzerland, where he spent the last three years of his life. The house was sold by Mann to an American lawyer and his wife, and remained in their family until its 2016 purchase by the German government. A restoration of the house is planned, and it is intended that the house will become an artist's residence, like the nearby Villa Aurora, the home of fellow German exile Lion Feuchtwanger.", 'title': 'Thomas Mann House'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Snow Falling on Cedars is a film directed by Scott Hicks. It is based on David Guterson's award-winning novel of the same title. It was released in 1999 and was nominated for an Academy Award for Best Cinematography.", 'title': 'Snow Falling on Cedars (film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Snow Falling on Cedars is a 1994 award-winning novel written by American writer David Guterson. Guterson, who was a teacher at the time, wrote the book in the early morning hours over a ten-year period. Because of the success of the novel, however, he quit his job and began to write full-time.', 'title': 'Snow Falling on Cedars'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'David Guterson ( ; born May 4, 1956) is an American novelist, short story writer, poet, journalist, and essayist. He is best known as the author of the book "Snow Falling on Cedars".', 'title': 'David Guterson'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Holy Sinner (in German, "Der Erwählte") is a German novel written by Thomas Mann. Published in 1951, it is based on the medieval verse epic "Gregorius" written by the German Minnesinger Hartmann von Aue (c. 1165-1210). The book explores a subject that fascinated Thomas Mann to the end of his life – the origins of evil and evil\'s connection with magic. Here Mann uses a medieval legend about "the exceeding mercy of God and the birth of the blessed Pope Gregory" as he used the biblical account of Joseph as the basis for Joseph and His Brothers – illuminating with his post-modernist "irony" the nature and relevance of medieval philosophy to the modern world (said connexion being "illuminated" is, in fact, ironic – in the classical sense).', 'title': 'The Holy Sinner'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Mann family is a German Hanseatic family, members of the small ruling class of the city republic of Lübeck. The family\'s most famous member is Nobel Prize for Literature laureate Thomas Mann, who portrayed his own family and social class in the novel "Buddenbrooks". The family became part of the commercial elite of Lübeck from the late 18th century. In 1877, Thomas Mann\'s father Thomas Johann Heinrich Mann was elected Senator of Lübeck (corresponding to Minister of Finance in other German states).', 'title': 'Mann family'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Paul Thomas Mann (] ; 6 June 1875 – 12 August 1955) was a German novelist, short story writer, social critic, philanthropist, essayist, and the 1929 Nobel Prize in Literature laureate. His highly symbolic and ironic epic novels and novellas are noted for their insight into the psychology of the artist and the intellectual. His analysis and critique of the European and German soul used modernized German and Biblical stories, as well as the ideas of Goethe, Nietzsche and Schopenhauer.', 'title': 'Thomas Mann'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Golo Mann (27 March 1909 – 7 April 1994), born Angelus Gottfried Thomas Mann, was a popular historian, essayist and writer. He was the third child of the novelist Thomas Mann and his wife Katia Mann.', 'title': 'Golo Mann'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The German School of Budapest - Thomas Mann Gymnasium (commonly referred to as DSB) ("German: Deutsche Schule Budapest - Thomas Mann Gymnasium") is a private international school in Budapest, Hungary. It was founded in 1908, and then re-founded in 1990, to serve German families in Hungary. It now has a diverse student body with primarily children of the expatriate business and diplomatic communities. The school is part of the worldwide network of the German (German schools abroad). Considered to be one of the best schools of its kind, it was awarded a Certificate of Excellence by the Central Agency for German Schools Abroad in 2012.', 'title': 'Thomas Mann Gymnasium (Budapest)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Dresser is a 1983 film, with a screenplay by Ronald Harwood, based on his 1980 play "The Dresser". It tells the story of an aging actor\'s personal assistant, who struggles to keep his charge\'s life together. The film was directed by Peter Yates and produced by Yates with Ronald Harwood. Cinematography was by Kelvin Pike. It stars Albert Finney, Tom Courtenay, Zena Walker, Eileen Atkins, Michael Gough and Edward Fox. Finney and Courtenay were both nominated for Academy Awards, BAFTA Awards and Golden Globe Awards for their performances, with Courtenay winning the Golden Globe Award for Best Actor – Motion Picture Drama in a tie with Robert Duvall in "Tender Mercies."', 'title': 'The Dresser (1983 film)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'King Rat is a 1965 World War II film directed by Bryan Forbes, and starring George Segal as Corporal King and James Fox as Marlowe, two World War II prisoners of war in a squalid camp near Singapore. Among the supporting cast were John Mills and Tom Courtenay. The film was adapted from James Clavell\'s novel "King Rat" (1962), which in turn is partly based on Clavell\'s experiences as a POW at Changi Prison during the Second World War.', 'title': 'King Rat (film)'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Loneliness of the Long Distance Runner is a 1962 film based on the short story of the same name.', 'title': 'The Loneliness of the Long Distance Runner (film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '45 Years is a 2015 British romantic drama film directed and written by Andrew Haigh. The film is based on the short story "In Another Country" by David Constantine. The film was screened in the main competition section of the 65th Berlin International Film Festival. Charlotte Rampling won the Silver Bear for Best Actress and Tom Courtenay won the Silver Bear for Best Actor. At the 88th Academy Awards, Rampling received a nomination for Best Actress in a Leading Role.', 'title': '45 Years'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "A Dandy in Aspic is a 1968 Technicolor and Panavision British spy film, directed by Anthony Mann, based on the novel of the same name by Derek Marlowe and starring Laurence Harvey, Tom Courtenay, and Mia Farrow. It was the Mann's final film.", 'title': 'A Dandy in Aspic'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Private Potter is a 1962 British drama film directed by Caspar Wrede and starring Tom Courtenay, Mogens Wieth, Ronald Fraser, and James Maxwell.', 'title': 'Private Potter'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Sir Thomas Daniel Courtenay ( ; born 25 February 1937) is an English actor who came to prominence in the early 1960s with a succession of films, including "The Loneliness of the Long Distance Runner" (1962), "Billy Liar" (1963), and "Doctor Zhivago" (1965). Since the mid-1960s, he has been known primarily for his work in the theatre, although he received an Academy Award nomination for Best Actor for the film adaptation of "The Dresser" (1983), which he had performed on the West End and on Broadway. He received a knighthood in February 2001 for his service to cinema and theatre.', 'title': 'Tom Courtenay'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Let Him Have It is a 1991 British drama film directed by Peter Medak and starring Christopher Eccleston, Paul Reynolds, Tom Courtenay and Tom Bell. The film is based on the true story of Derek Bentley.', 'title': 'Let Him Have It'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"The Loneliness of the Long-Distance Runner" is a short story by Alan Sillitoe, published in 1959 as part of a short story collection of the same name. The work focuses on Smith, a poor Nottingham teenager from a dismal home in a working class area, who has bleak prospects in life and few interests beyond petty crime. The boy turns to long-distance running as a method of both an emotional and a physical escape from his situation. The story was adapted for a 1962 film of the same title, with Sillitoe writing the screenplay and Tony Richardson directing. The part of Smith (now called Colin) was played by Tom Courtenay.', 'title': 'The Loneliness of the Long-Distance Runner'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Otley is a 1969 British comedy thriller film, starring Tom Courtenay and Romy Schneider. It was adapted by Dick Clement and Ian La Frenais from a book by Martin Waddell, and released by Colombia Pictures. Film critic Judith Crist described it as "a bright, breezy, light-handed but never lightheaded spies-and-counterspies story".', 'title': 'Otley (film)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Karl Kraus (April 28, 1874 – June 12, 1936) was an Austrian writer and journalist, known as a satirist, essayist, aphorist, playwright and poet. He directed his satire at the press, German culture, and German and Austrian politics. The Austrian author Stefan Zweig once called Kraus "the master of venomous ridicule" ("der Meister des giftigen Spotts").', 'title': 'Karl Kraus (writer)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Stephan Templ is an Austrian writer and journalist who is best known as the co-author of the book "Unser Wien (Our Vienna)" that details how hundreds of Jewish businesses in Vienna were seized by the Nazis and never given back.', 'title': 'Stephan Templ'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Daniel Glattauer (born May 19, 1960) is an Austrian writer and former journalist. He was born in Vienna, where he still lives and works. A former regular columnist for "Der Standard," a national daily newspaper, he is best known for his dialogic epistolary novel "Love Virtually (Gut gegen Nordwind)" and its sequel "Every Seventh Wave (Alle sieben Wellen)".', 'title': 'Daniel Glattauer'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Wall (German: Die Wand ) is a 2012 Austrian-German drama film written and directed by Julian Pölsler and starring Martina Gedeck. Based on the 1963 novel "Die Wand" by Austrian writer Marlen Haushofer and adapted for the screen by Julian Pölsler, the film is about a woman who visits with friends at their hunting lodge in the Austrian Alps. Left alone while her friends walk to a nearby village, the woman soon discovers she is cut off from all human contact by a mysterious invisible wall. With her friends\' loyal dog Lynx as her companion, she lives the next three years in isolation looking after her animals. "The Wall" was filmed on location in the Salzkammergut region of the Austrian Alps. The film was selected as the Austrian entry for the Best Foreign Language Film at the 86th Academy Awards, but it was not nominated.', 'title': 'The Wall (2012 drama film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Leopold Ritter von Sacher-Masoch (27 January 1836 – 9 March 1895) was an Austrian writer and journalist, who gained renown for his romantic stories of Galician life. The term masochism is derived from his name.', 'title': 'Leopold von Sacher-Masoch'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Short Letter, Long Farewell (German: Der kurze Brief zum langen Abschied ) is a 1972 novel by the Austrian writer Peter Handke. It tells the story of a young Austrian writer who travels across the United States in search of his wife from whom he is estranged. The film-director John Ford appears as a character who brings resolution at the end of the road on the coast of California. His film Young Mr. Lincoln also serves as a point of reference and an antidote to the alienation experienced by the stranger crossing the States. The novel shares many themes and motifs with the film "Alice in the Cities" from 1974, directed by Handke\'s frequent collaborator Wim Wenders; the film can be seen as a response to the book.', 'title': 'Short Letter, Long Farewell'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Nathan Birnbaum (Hebrew: נתן בירנבוים\u200e \u200e ; pseudonyms: "Mathias Acher", "Dr. N. Birner", "Mathias Palme", "Anton Skart", "Theodor Schwarz", and "Pantarhei") (16 May 1864 – 2 April 1937) was an Austrian writer and journalist, Jewish thinker and nationalist. His life had three main phases, representing a progression in his thinking: a Zionist phase (c. 1883 – c. 1900); a Jewish cultural autonomy phase (c. 1900 – c. 1914) which included the promotion of the Yiddish language; and religious phase (c. 1914–1937) when he turned to Orthodox Judaism and became staunchly anti-Zionist.', 'title': 'Nathan Birnbaum'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Otto Basil (24 December 1901 Vienna - 19 February 1983 (Pseudonyms: Markus Hörmann, Camill Schmall) was an Austrian writer publisher and journalist.', 'title': 'Otto Basil'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Rudolf Brunngraber (1901, Vienna - 1960) was an Austrian writer, journalist and painter who worked with Otto Neurath. His novels were translated into eighteen languages, with more than a million books sold.', 'title': 'Rudolf Brunngraber'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': '"Journaille " is a German pejorative term used to refer to tabloid journalism and the yellow press. The term is a neologism from the early 20th century, formed from the word journalism and the French loan-word "kanaille" ("canaille"), meaning scum, scoundrel or rabble. The term was introduced by the Austrian writer Karl Kraus in an article in his journal "Die Fackel" in 1902. In a later article in the same journal, Kraus wrote that the original inventor of the term was the Austrian dramaturge Alfred von Berger. The pejorative term was much used by the German Nazi Party in their attacks on the press of the Weimar Republic. Unlike many other terms used by the Nazis, the word "journaille " is still used in present-day Germany, and has also established itself in the political parlance of the Netherlands and Flanders.', 'title': 'Journaille'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Ann Beattie (born September 8, 1947) is an American novelist and short story writer. She has received an award for excellence from the American Academy and Institute of Arts and Letters and the PEN/Malamud Award for excellence in the short story form. Her work has been compared to that of Alice Adams, J.D. Salinger, John Cheever, and John Updike. She holds an undergraduate degree from American University and a master's degree from the University of Connecticut.", 'title': 'Ann Beattie'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Jay Gould House was a mansion located at 857 Fifth Avenue at East 67th Street on the Upper East Side of Manhattan, New York City. It was constructed for Jay Gould in the French Neo-Gothic style, and given by Gould to his son George Jay Gould in 1868. The younger Gould tore the mansion down in 1906, and had the George J. Gould House built in its place.', 'title': 'Jay Gould House'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Jay Gould II (September 1, 1888 – January 26, 1935) was an American real tennis player and a grandson of the railroad magnate Jay Gould. He was the world champion (1914–1916) and the Olympic gold medalist (London, 1908, then under the name jeu de paume). He held the U.S. Amateur Championship title continuously from 1906–1925, winning 18 times (no tournaments were held during the U.S. involvement in World War I). During the same period, he never lost a set to an American amateur, and lost only one singles match, to English champion E.M. Baerlein. The court built for him by his father at the family's Georgian Court estate was restored in 2005. Jay Gould II is the great great uncle of US Olympic cyclist Georgia Gould, who qualified to race in the London 2012 Olympiad.", 'title': 'Jay Gould II'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'I Have Landed (2002) is the 10th and final volume of collected essays by the Harvard paleontologist Stephen Jay Gould. The essays were culled from his monthly column "This View of Life" in "Natural History" magazine, to which Gould contributed for 27 years. The book deals, in typically discursive fashion, with themes familiar to Gould\'s writing: evolution and its teaching, science biography, probabilities and common sense.', 'title': 'I Have Landed'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Stephen Jay Gould ( ; September 10, 1941 – May 20, 2002) was an American paleontologist, evolutionary biologist, and historian of science. He was also one of the most influential and widely read writers of popular science of his generation. Gould spent most of his career teaching at Harvard University and working at the American Museum of Natural History in New York. In 1996 Gould was also appointed as the Vincent Astor Visiting Research Professor of Biology at New York University, where he divided his time teaching both there and at Harvard.', 'title': 'Stephen Jay Gould'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Dinosaur in a Haystack (1995) is the seventh volume of collected essays by the Harvard paleontologist Stephen Jay Gould. The essays were culled from his monthly column "The View of Life" published in "Natural History" magazine, which Gould contributed for 27 years. The book deals with themes familiar to Gould\'s writing: evolution, science biography, probabilities, and strange oddities found in nature.', 'title': 'Dinosaur in a Haystack'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Flamingo\'s Smile: Reflections in Natural History, published in 1985, is the fourth volume of collected essays from evolutionary biologist and well-known science writer Stephen Jay Gould; the essays were culled from his monthly column "The View of Life" in "Natural History" magazine, to which Gould contributed for more than two decades. The book deals, in typically discursive fashion, with themes familiar to Gould\'s writing: evolution and its teaching, science biography, probabilities and common sense.', 'title': "The Flamingo's Smile"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Eight Little Piggies (1993) is the sixth volume of collected essays by the Harvard paleontologist Stephen Jay Gould. The essays were selected from his monthly column "The View of Life" in "Natural History" magazine, to which Gould contributed for 27 years. The book deals, in typically discursive fashion, with themes familiar to Gould\'s writing: evolution and its teaching, science biography, probabilities and common sense.', 'title': 'Eight Little Piggies'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Structure of Evolutionary Theory (2002) is Harvard paleontologist Stephen Jay Gould's technical book on macroevolution and the historical development of evolutionary theory. The book was twenty years in the making, published just two months before Gould's death. Aimed primarily at professionals, the volume is divided into two parts. The first is a historical study of classical evolutionary thought, drawing extensively upon primary documents; the second is a constructive critique of the modern synthesis, and presents a case for an interpretation of biological evolution based largely on hierarchical selection, and the theory of punctuated equilibrium (developed by Niles Eldredge and Gould in 1972).", 'title': 'The Structure of Evolutionary Theory'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Ever Since Darwin is a 1977 book by the paleontologist Stephen Jay Gould. Gould\'s first book of collected essays, it originated from his monthly column "This View of Life," published in "Natural History" magazine. Edwin Barber—who was then the editorial director for W. W. Norton & Company— encouraged Gould to produce a book. He soon commissioned Gould to write "The Mismeasure of Man", but it was not until three years later, when Gould accumulated 33 columns, that it occurred to either of them that the "Natural History" columns should be published in a single volume. The collection of essays, written between 1973–1977, became a best-seller and propelled Gould to national prominence.', 'title': 'Ever Since Darwin'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Kiss is the second studio album by Canadian recording artist Carly Rae Jepsen. It was released on September 14, 2012, by 604, Schoolboy and Interscope Records. After her debut, "Tug of War" (2008), which managed to receive success in Canada but was never released worldwide, "Kiss" became Jepsen\'s first internationally released album. Songs on the album are in the nu-disco, dance-pop, and teen pop genres, drawing inspiration from The Cars, Madonna, and Swedish performer, Robyn. Featuring production from a wide collection of producers including Dallas Austin, Josh Ramsay, and Redfoo, the album features a track with guest vocals from Justin Bieber.', 'title': 'Kiss (Carly Rae Jepsen album)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Levolution is the second studio album by Australian rock band Juke Kartel, and the first American released album. Levolution was released to the Australian public through Carved Records on 20 August 2010, and later released to the United States on 28 September 2010. Produced by Brian Virtue (Jane\'s Addiction, Velvet Revolver, Thirty Seconds to Mars, Chevelle) and Rick Parashar (Pearl Jam, Alice in Chains, 3 Doors Down, Nickelback), the album features a half-dozen freshly penned tracks and six from the band\'s 2009 Australian CD, Nowhere Left to Hide, remixed by Dan Korneff (My Chemical Romance, Cavo). With its overarching theme of personal growth and "the journey we’re all on", says vocalist/lyricist Toby Rand, Levolution finds musical parity in its strong hooks, multi-textured instrumentals and passionate vocals.', 'title': 'Levolution (album)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Deceit is an original novel written by Peter Darvill-Evans and based on the long-running British science fiction television series "Doctor Who". It features the Seventh Doctor, Ace and Bernice. Also included is "Doctor Who Magazine" comic character Abslom Daak, in his first appearance outside "DWM". A prelude to the novel, also penned by Darvill-Evans, appeared in "Doctor Who Magazine" #198.', 'title': 'Deceit (Doctor Who novel)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'A Boy in a Man\'s World is the second studio album by Mucky Pup. The album was recorded at Nevessa Productions and released in 1989 through Torrid Records and Roadrunner Records. The album features a re-recorded version of "U-Stink-But-I-♥-U," which the band had previously won a Bloom County songwriting contest with. The band would also shoot their first music video for this song. The album also features "Batman", a song based on an urban legend that also contains a snippet of the title theme to the 1966 "Batman" TV.', 'title': "A Boy in a Man's World"}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Ghost Rider is a song by the protopunk band Suicide appearing on their debut album. The song is based on the Marvel Comics character.', 'title': 'Ghost Rider (Suicide song)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"In My Country There Is Problem", also known as "Throw the Jew Down the Well" after the song\'s key line, is a song written by British comedian Sacha Baron Cohen for his comic character Borat Sagdiyev. It features in the \'Country Music\' segment of "Borat\'s Guide to the USA (Part 2)", that focuses heavily on the (positive) reaction of the patrons of an Arizona country and western bar to the antisemitic sentiments of the song. It appeared in "".', 'title': 'In My Country There Is Problem'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'A Week of Garfield (ガーフィールドの一週間 , Gāfirudo no Isshukan ) is a 1989 Family Computer title based on the comic character Garfield. It was only released in Japan due to issues with using the Garfield license in North America and Europe. It is the third video game to be based on Jim Davis\' "Garfield" Comics.', 'title': 'A Week of Garfield'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Suicide is the debut album from the American rock band Suicide. It was released in 1977 on Red Star Records and produced by Craig Leon and Marty Thau. The album was recorded in four days at Ultima Sound Studios in New York and featured Martin Rev's minimalist electronics and harsh, repetitive rhythms paired with Alan Vega's rock and roll-inspired vocals and depictions of urban life.", 'title': 'Suicide (1977 album)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Nagaram Marupakkam (English: The other side of the town ) is a 2010 Indian Tamil action film co-produced written and directed by Sundar C., who himself plays the lead role. Co-produced by his wife Kushboo, the film also stars Anuya Bhagvath and Vadivelu in pivotal roles and features music by Thaman. Sundar\'s first directorial after five years, "Nagaram" released on 19 November 2010, it is based on the 1993 American movie Carlito\'s Way . The film is very well known for comedy sequences and portrayal of the comic character "Style Pandi" by Vadivelu.', 'title': 'Nagaram (2010 film)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Impossible Dream is Patty Griffin’s fifth commercially released album, and fourth studio album. It was released on April 20, 2004. The album features an unlisted song – Griffin’s mother and father singing “The Impossible Dream” – at the end of “Top of the World.”', 'title': 'Impossible Dream'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Makiko Futaki (June 19, 1958 – May 13, 2016) was a Japanese animator best known for her work at Studio Ghibli for more than thirty years. Futaki, who joined Studio Ghibli in 1981, worked on all of Hayao Miyazaki\'s animated feature films, beginning with "Nausicaä of the Valley of the Wind" in 1984. Her best known Studio Ghibli\'s productions include "My Neighbor Totoro" (1988), "Princess Mononoke" (1997), "Spirited Away" (2001), which won an Academy Award for Best Animated Feature, and "Howl\'s Moving Castle" (2004). Her last film credit was Hiromasa Yonebayashi\'s "When Marnie Was There" (2014), which is Studio Ghibli\'s final feature film to date.', 'title': 'Makiko Futaki'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"Digimon Adventure 02" is a 50-episode sequel of the 1999 anime series "Digimon Adventure". It was created by Toei Animation and aired in Japan on Fuji TV between April 2, 2000, and March 25, 2001. The series was directed by Hiroyuki Kakudō and produced by Keisuke Okuda. Music for "Digimon Adventure 02" was composed by Takanori Arisawa, and characters were designed by Katsuyoshi Nakatsuru. The story, set in an alternate timeline of the real world, opens four years after the events of "Digimon Adventure" with the next generation of DigiDestined children. In their quest to maintain peace in the Digital World, the children battle both new and returning foes. In a 2001 survey published by Japanese anime and entertainment magazine "Animage" of its readers, "Digimon Adventure 02" placed 17th, tied with the 1988 film "My Neighbor Totoro", on the list of anime that should be most remembered in the 21st century.', 'title': 'List of Digimon Adventure 02 episodes'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ufotable, Inc. (ユーフォーテーブル有限会社 , Yūfōtēburu yūgen-gaisha ) is a Japanese animation studio founded in October 2000 by former TMS Entertainment staff through its subsidiary Telecom Animation Film and located in Nakano, Tokyo Prefecture. A unique hallmark seen in many of their works ("Ninja Nonsense", "Futakoi Alternative", "Coyote Ragtime Show", "Gakuen Utopia Manabi Straight! ", "", "Kara no Kyōkai") is a claymation sequence.', 'title': 'Ufotable'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Studio Ghibli is a Japanese animation film studio founded in 1985. In addition to producing 18 feature films, the studio has produced several short films, including commercials, films for the Ghibli Museum, music videos, and works released directly to video.', 'title': 'Short films by Studio Ghibli'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Studio Ghibli, Inc. (Japanese: 株式会社スタジオジブリ , Hepburn: Kabushiki-gaisha Sutajio Jiburi ) is a Japanese animation film studio based in Koganei, Tokyo, Japan. The studio is best known for its anime feature films, and has also produced several short films, television commercials, and one television film. It was founded on 15 June 1985, after the success of "Nausicaä of the Valley of the Wind" (1984), with funding by Tokuma Shoten.', 'title': 'Studio Ghibli'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'CoMix Wave Films, Inc. (Japanese: コミックス・ウェーブ・フィルム , Hepburn: Komikkusu Uēbu Firumu ) is a Japanese animation film studio and distribution company based in Chiyoda, Tokyo, Japan. The studio is known for its anime feature films, short films, and television commercials, particularly those made by director Makoto Shinkai. It was founded in March 2007 when it split from CoMix Wave Inc., which was initially formed in 1998 from Itochu Corporation, ASATSU (now ADK), and other companies.', 'title': 'CoMix Wave Films'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Giatrus (Japanese: ギャートルズ , Hepburn: Gyātoruzu ) is a Japanese manga written and illustrated by Shunji Sonoyama. It spawned two other manga, two anime television series, a television drama, and an anime film. The first TV series mark the debut of Joe Hisaishi, composer of "My Neighbor Totoro" and "Spirited Away". The official English title is Gon, The Stone-Age Boy.', 'title': 'First Human Giatrus'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Ghibli Museum (三鷹の森ジブリ美術館 , Mitaka no Mori Jiburi Bijutsukan , Mitaka Forest Ghibli Museum) is a museum showcasing the work of the Japanese animation studio Studio Ghibli. It is located in Inokashira Park in Mitaka, a western city of Tokyo, Japan. The museum combines features of a children\'s museum, technology museum, and a fine arts museum, and is dedicated to the art and technique of animation. Some features include a replica of the Catbus from "My Neighbor Totoro" (1988), a café, bookstore, rooftop garden, and a theater for exclusive short films by Studio Ghibli.', 'title': 'Ghibli Museum'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'My Neighbor Totoro (Japanese: となりのトトロ , Hepburn: Tonari no Totoro ) is a 1988 Japanese animated fantasy film written and directed by Hayao Miyazaki and produced by Studio Ghibli. The film – which stars the voice actors Noriko Hidaka, Chika Sakamoto, and Hitoshi Takagi – tells the story of the two young daughters (Satsuki and Mei) of a professor and their interactions with friendly wood spirits in postwar rural Japan. The film won the Animage Anime Grand Prix prize and the Mainichi Film Award and Kinema Junpo Award for Best Film in 1988. It also received the Special Award at the Blue Ribbon Awards in the same year.', 'title': 'My Neighbor Totoro'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Azumi Inoue (井上 あずみ or 井上杏美 , Inoue Azumi , born February 10, 1965 in Kanazawa, Ishikawa Prefecture, Japan) is a Japanese singer. She graduated from Yugakkan High School in Kanazawa. She is best known for singing the opening and ending theme songs for the Hayao Miyazaki film "My Neighbor Totoro": "Sanpo" and "My Neighbor Totoro". She is known for having a clear, light voice.', 'title': 'Azumi Inoue'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Ender in Exile is a science fiction novel by Orson Scott Card, part of the "Ender\'s Game" series, published on November 11, 2008. It takes place between the two award-winning novels: "Ender\'s Game" and "Speaker for the Dead". It could also be considered a parallel novel to the first three sequels in the Shadow Saga, since the entirety of this "trilogy" takes place in the span of "Ender in Exile". The novel concludes a dangling story line of the Shadow Saga, while it makes several references to events that take place during the Shadow Saga. From yet another perspective, the novel expands (or "replaces") the last chapter of the original novel "Ender\'s Game". On the one hand, it fills the gap right before the last chapter, and on the other hand, it fills the gap between the last chapter and the original (first) sequel (both named "Speaker for the Dead"). "Ender in Exile" begins one year after Ender has won the bugger war, and begins with the short story "Ender\'s Homecoming" from Card\'s webzine Intergalactic Medicine Show. Other short stories that were published elsewhere are included as chapters of the novel.', 'title': 'Ender in Exile'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Bone People (styled by the writer and in some editions as the bone people) is a Booker Prize-winning 1984 novel by New Zealand writer Keri Hulme.', 'title': 'The Bone People'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Ender\'s Game" is a story by Orson Scott Card. It first appeared in the August 1977 issue of "Analog" magazine and was later expanded into the novel "Ender\'s Game". Although the foundation of the Ender\'s Game series, the short story is not properly part of the "Ender\'s Game" universe, as there are many discrepancies in continuity.', 'title': "Ender's Game (short story)"}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Orson Scott Card (born August 24, 1951) is an American novelist, critic, public speaker, essayist, and columnist. He writes in several genres but is known best for science fiction. His novel "Ender\'s Game" (1985) and its sequel "Speaker for the Dead" (1986) both won Hugo and Nebula Awards, making Card the only author to win both science fiction\'s top U.S. prizes in consecutive years. A feature film adaptation of "Ender\'s Game", which Card co-produced, was released in late October 2013 in Europe and on November 1, 2013, in North America.', 'title': 'Orson Scott Card'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Shadow of the Hegemon (2001) is the second novel in the "Ender\'s Shadow" series (often called the Bean Quartet) by Orson Scott Card. It is also the sixth novel in the "Ender\'s Game" series. It is told mostly from the point of view of Bean, a largely peripheral character in the original novel "Ender\'s Game" but the central protagonist of the parallel narrative "Ender\'s Shadow." "Shadow of the Hegemon" was nominated for a Locus Award in 2002.', 'title': 'Shadow of the Hegemon'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Keri Hulme (born 9 March 1947) is a New Zealand writer. Her only novel, "The Bone People", won the Booker Prize in 1985.', 'title': 'Keri Hulme'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'This is a list of the works of Orson Scott Card. This list does not include criticisms, reviews, or related material written by Card. Orson Scott Card is the author of The Ender saga and Homecoming Saga among many other works.', 'title': 'Orson Scott Card bibliography'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'A War of Gifts: An Ender Story (2007) is a science fiction novel by Orson Scott Card. This book is set in Card\'s Ender\'s Game series and takes place during Ender Wiggin\'s time at Battle School as described in Card\'s novels "Ender\'s Game" and "Ender\'s Shadow".', 'title': 'A War of Gifts: An Ender Story'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Andrew "Ender" Wiggin is a fictional character from Orson Scott Card\'s 1985 science fiction novel "Ender\'s Game" and its sequels ("Speaker for the Dead", "Xenocide", "Children of the Mind", "Ender in Exile"), as well as in the first part of the spin-off series, "Ender\'s Shadow". The book series itself is an expansion, with some changes to detail, of Card\'s 1977 short story "Ender\'s Game."', 'title': 'Ender Wiggin'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'There are various sources for short stories set in the Ender\'s Game series. One is the short story collection "First Meetings" by Orson Scott Card. This collection contains the original novelette "Ender\'s Game" plus three other stories. Another source is Card’s webzine "InterGalactic Medicine Show". The first four stories from Card\'s webzine: "Mazer in Prison," "Pretty Boy," "Cheater," and "A Young Man with Prospects," also appear in the paperback anthology "Orson Scott Card\'s InterGalactic Medicine Show". Reprints of short stories in the Ender\'s Game series can be found in other science fiction anthologies.', 'title': "List of Ender's Game series short stories"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Ao Li (born 8 February 1988) is a Chinese operatic bass-baritone and voice teacher who is particularly known for his performances at the San Francisco Opera. In 2013 he won first prize in the Operalia, The World Opera Competition and in 2014 he won the Metropolitan Opera National Council Auditions.', 'title': 'Ao Li'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Sonya Yoncheva (Bulgarian: Соня Йончева, born 25 December 1981) is a Bulgarian operatic soprano.', 'title': 'Sonya Yoncheva'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Maria Katzarava (born 1984) is an opera singer from Mexico who achieved international fame by winning first place in the Operalia competition in the opera and zarzuela categories. Prior to this, she came to the attention of notable Mexican tenor Ramón Vargas, who helped her get a scholarship, and then won Mexico's Carlo Morelli national singing competition in 2005, which earned her a debut at the Palacio de Bellas Artes. Since winning the Operalia competition, Katzarava has performed in Europe, where she currently lives, Asia and the Americas. She currently trains with soprano Mirella Freni.", 'title': 'Maria Katzarava'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Rachel Willis-Sørensen (born 1984) is an American operatic soprano. She was a winner of the Metropolitan Opera National Council Auditions in 2010. In 2014, she won first prize, the Birgit Nilsson Prize, and the Zarzuela Prize of the Operalia competition. Other awards include first place in the 2009 Eleanor McCollum Competition for Young Singers in Houston and the 2010 Sara Tucker Grant from the Richard Tucker Music Foundation.', 'title': 'Rachel Willis-Sørensen'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Guanqun Yu (; born 1982) is a Chinese soprano who has sung in opera houses and concert halls internationally. In 2008 she won the Belvedere International Singing Competition and in 2012 she placed 2nd in the Operalia, The World Opera Competition. She is particularly known for portraying heroines in the operas of Wolfgang Amadeus Mozart, Giacomo Puccini, and Giuseppe Verdi.', 'title': 'Guanqun Yu'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Operalia, The World Opera Competition is an annual international competition for young opera singers. Founded in 1993 by Plácido Domingo, the competition has helped launch the careers of several important artists, such as Joseph Calleja, Giuseppe Filianoti, Rolando Villazón, José Cura, Joyce DiDonato, Elizabeth Futral, Inva Mula, Ana María Martínez and Sonya Yoncheva.', 'title': 'Operalia, The World Opera Competition'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Bogdan Volkov is a Russian operatic tenor. Born in Ukraine, one of the most young talented tenors of his generation. He is the winner of second prize at Plácido Domingo’s Operalia, The World Opera Competition in Guadalajara, Mexico in 2016 and first prize at the Paris Opera Competition in 2015.', 'title': 'Bogdan Volkov'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Joseph Calleja, (born 22 January 1978 in Attard), is a Maltese tenor. He began singing at the age of 16, having been discovered by tenor Brian Cefai and continued his studies with Paul Asciak. At 19, he made his operatic debut as Macduff in Verdi\'s "Macbeth" at the Astra Theatre in Gozo and went on to become a prize winner at the Belvedere Hans Gabor Competition the same year. In 1998, he won the Caruso Competition in Milan and was a prize winner in Plácido Domingo\'s Operalia International Opera Competition in 1999.', 'title': 'Joseph Calleja'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Prof. Liao Changyong (; born October 25, 1968), sometimes referred in Western media as C. Y. Liao or Changyong Liao, is a Chinese operatic baritone and academic. He won first prize in three different international competitions in 1996 and 1997: the Operalia, The World Opera Competition; the French International Toulouse Singing Competition; and the Queen Sonja International Music Competition. While his performance career has mainly been in China, he has appeared as a guest artist with opera companies and orchestras internationally. He is the head of the voice department at the Shanghai Conservatory of Music.', 'title': 'Liao Changyong'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Andrea Carroll is an American soprano who has had an active international career in concerts and operas since 2012. A finalist in the 2015 Operalia, The World Opera Competition, she is particularly known for her performances with the Houston Grand Opera and the Vienna State Opera.', 'title': 'Andrea Carroll (soprano)'}]

