 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Infinite H (Korean: 인피니트H ) is the first official sub-unit of South Korean boy group Infinite formed under Woollim Entertainment in 2013. The sub-group consists of Infinite members Dongwoo and Hoya. The sub-unit debuted with their mini album titled Fly High in January 2013.', 'title': 'Infinite H'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Hey Mama" is the debut single by EXO-CBX, the first official sub-unit of the South Korean boy group EXO. It was released on October 31, 2016 by S.M. Entertainment as the title track of their debut extended play "Hey Mama! ". The Japanese version of the song was released on May 24, 2017 along with their Japanese debut EP "Girls".', 'title': 'Hey Mama! (song)'}
