 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Bastarz (Korean: 바스타즈; stylized BASTARZ) is the first official sub-unit of the South Korean boy group Block B. Established in April 2015, the sub-unit consists of three members: Block B\'s two main dancers, B-Bomb and U-Kwon, and the rapper P.O. The sub-unit debuted with their first mini album, entitled "Conduct Zero," on April 14, 2015, and released their second mini album, "Welcome 2 Bastarz," on October 31, 2016.', 'title': 'Bastarz'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Jung Taek-woon (Hangul:\xa0정택운 , born on November 10, 1990), better known by his stage name Leo (Hangul:\xa0레오 ), is a South Korean singer, songwriter and musical theatre actor, signed under Jellyfish Entertainment. Known for his high-pitched, sharp, and clear vocals, Leo debuted as a member of the South Korean boy group VIXX in May 2012, and began his acting career in 2014 in the musical "Full House" as Lee Young-jae. In 2015 he began his songwriting career, and with VIXX member Ravi formed VIXX\'s first official sub-unit VIXX LR.', 'title': 'Leo (singer)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'EXO-CBX (, also known as CBX or ChenBaekXi) is the first official sub-unit of South Korean boy group EXO. Formed by S.M. Entertainment in 2016, the group is composed of three EXO members: Chen, Baekhyun, and Xiumin. Their debut extended play "Hey Mama! " was released in October 2016.', 'title': 'EXO-CBX'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'VIXX LR (Korean: 빅스 LR ) is the first official sub-unit of South Korean boy band VIXX formed by Jellyfish Entertainment. Established in August 2015, VIXX LR consists of VIXX\'s main vocalist Leo and main rapper Ravi. The sub-unit debuted with their first mini album, titled "Beautiful Liar" on August 17, 2015.', 'title': 'VIXX LR'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Ka-CHING!" is the Japanese debut single by EXO-CBX, the first official sub-unit of the South Korean boy group EXO. It was officially released on May 24, 2017 by Avex Trax as the title track of their debut Japanese extended play "Girls". The song was first revealed in the short version of the music video on May 1.', 'title': 'Ka-Ching! (EXO-CBX song)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Hey Mama! is the debut extended play by EXO-CBX, the first official sub-unit of the South Korean boy group EXO. It was released on October 31, 2016 by S.M. Entertainment under distribution by KT Music. The EP features five tracks in total with a variety of genres.', 'title': 'Hey Mama!'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Trump Plaza is a closed hotel and casino on the Boardwalk in Atlantic City, New Jersey, owned by Trump Entertainment Resorts. Designed by architect Martin Stern, Jr., it operated from May 15, 1984 until September 16, 2014.', 'title': 'Trump Plaza Hotel and Casino'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Atlantic Club Casino Hotel, formerly known as Golden Nugget, Bally\'s Grand, Atlantic City Hilton and ACH, is a closed casino and hotel located at the southern end of the boardwalk in Atlantic City, New Jersey, owned and operated by Colony Capital. It was the city\'s first and only "locals casino". The Atlantic Club permanently closed on January 13, 2014, at 12:01 AM. largely as a result of dwindling casino visitors to Atlantic City due to increased competition in neighboring states. A third of Atlantic City\'s boardwalk casinos closed the same year, the others being Revel, Trump Plaza, and Showboat. Redevelopment proposals include a water park.', 'title': 'The Atlantic Club Casino Hotel'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Saratoga Casino Hotel (formerly Saratoga Casino and Raceway) is an establishment in Saratoga Springs, New York. Saratoga Casino Hotel is home to a -mile standardbred race track, with a racino and hotel located inside the racetrack's grandstand. Saratoga Casino Hotel is not to be confused with the historic Saratoga Race Course thoroughbred race track located across the street on Nelson Avenue.", 'title': 'Saratoga Casino Hotel'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Trumped! The Inside Story of the Real Donald Trump – His Cunning Rise and Spectacular Fall is a 1991 book about Donald Trump that was written by John O'Donnell and James Rutherford, and published by Simon & Schuster. Prior to writing the book, O'Donnell worked for Trump for three years, including one year as the president and chief operating officer of the Trump Plaza Hotel and Casino in Atlantic City, New Jersey. In the book, O'Donnell claims that Trump is racist, cheap, and an incompetent businessman.", 'title': 'Trumped! (book)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Sands Casino Hotel was a casino and hotel that operated from August 13, 1980 until November 11, 2006 in Atlantic City, New Jersey. It was formerly known as the Brighton Hotel & Casino. It consisted of a 21-story hotel tower with 532 rooms and a 5-story podium housing the 57045 ft casino and various other amenities. It was adjacent to Claridge Atlantic City and its parking garage was adjacent to the Madison Hotel.', 'title': 'Sands Atlantic City'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Ponce Plaza Hotel & Casino, formerly Ponce Ramada Hotel and Ponce Plaza Ramada Hotel, is a hotel in Ponce, Puerto Rico. The hotel opened in the summer of 2009 and is known for the historic value of its structure: its main entrance is a historic colonial structure known as "Casa Saurí" (Saurí House). In February 2013, the hotel expanded its facilities to include a casino, a cocktail lounge, and a 4-story, 200-car parking garage. On 1 July 2014, the owners left the Ramada namesake franchise and renamed the hotel Ponce Plaza Hotel & Casino.', 'title': 'Ponce Plaza Hotel &amp; Casino'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Trump World's Fair at Trump Plaza was a hotel and casino in Atlantic City, New Jersey that occupied 280 feet of the Atlantic City boardwalk and was 21 floors in height. It had 500 guest rooms. It opened on April 14, 1981 as the Playboy Hotel and Casino, then changed its name in 1984 to Atlantis Hotel and Casino.", 'title': "Trump World's Fair"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Trump Entertainment Resorts, Inc. was a gaming and hospitality company that owned and operated the now shuttered Trump Taj Mahal hotel and casino, as well as the now shuttered Trump Plaza Hotel and Casino and the Trump Marina located in Atlantic City, New Jersey, United States. Formerly known as Trump Hotels & Casino Resorts, it was founded in 1995 by Donald Trump, now 45th President of the United States, who has not had any formal role in the company since 2011, if not earlier. The company filed for bankruptcy in 2004, 2009 and 2014. It has been a subsidiary of Icahn Enterprises since 2016.', 'title': 'Trump Entertainment Resorts'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'TEN (formerly Revel Casino Hotel Atlantic City) is a closed resort, hotel and casino in Atlantic City, New Jersey, United States. It is the northernmost casino on the Atlantic City Boardwalk, located on 20 acre of land, adjacent to the Showboat Hotel. Revel opened on April 2, 2012, and after declaring Chapter 11 bankruptcy for the second time, closed on September 2, 2014. Revel was the third of four Atlantic City casinos to close in 2014. It was supposed to open in June 2017 but it didn’t.', 'title': 'TEN Atlantic City'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Resorts Casino Hotel is a hotel and casino in Atlantic City, New Jersey. Resorts was the first casino hotel in Atlantic City, becoming the first legal casino outside of Nevada in the United States, when it opened on May 26, 1978. The resort completed an expansion in 2004, adding the 27-story Rendezvous Tower, and underwent renovations in 2011, converting the resort to a Roaring Twenties theme.', 'title': 'Resorts Casino Hotel'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Mendham Borough, New Jersey native Ed McKirdy has been performing in bands from both the West and East coasts since 1992. He has released records and CDs as the bass player for New Records Recording Artists The Suppression Swing (CA), Equal Vision Records Recording Artists Hands Tied (NJ) and The Killing Flame (CA), Defiance Records Recording Artists Face The Enemy (DC) and is currently the guitar player for Bridge 9 Records and Livewire Records Recording Artists Triple Threat (NY). McKirdy also served as vocalist for the short-lived outfit 5 Star (NJ) who released just one song "MVP" on the Compilation. McKirdy is also the founder of Brooklyn-based record label Livewire Records; an independent record company he started in 1999 while living in Seal Beach, California.', 'title': 'Ed McKirdy'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Life\'s Aquarium is the fourth studio album by American R&B group Mint Condition. The album was released on November 16, 1999, and it is their first album released for Elektra Records. It is their first studio recording after their departure from Perspective Records, the record company that produced their three previous albums. They made their debut as Elektra artists on the soundtrack to the motion picture "Why Do Fools Fall in Love" with the song "Love is for Fools". They were originally signed to Elektra subsidiary East West Records, but were later moved to Elektra proper for the release of "Life\'s Aquarium".', 'title': "Life's Aquarium"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Primitives are an English indie pop band from Coventry, best known for their 1988 international hit single "Crash". Formed in 1984, disbanded in 1992 and reformed in 2009, the band\'s two constant members throughout their recording career have been vocalist Tracy Tracy and guitarist Paul Court. Drummer Tig Williams has been a constant member since 1987 and the reformed line-up is completed by bassist Raph Moore. Often described as an indie pop or indie rock band, The Primitives\' musical style can also be seen as straddling power pop, new wave and pop punk.', 'title': 'The Primitives'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Music for People is the second album by the band VAST, released in September 12,2000 by Elektra Records. It would be VAST\'s last album on Elektra Records. After the success of VAST\'s debut album, "Music for People" could only produce one successful single, "Free", which gained major MTV exposure. However, after the mixed success of the album, VAST and Elektra Records parted ways over disappointing sales and differing views on the future of the band.', 'title': 'Music for People (album)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Pooh Sticks were an indie pop band from Swansea, Wales recording between 1988 and 1995. They were notable for their jangly melodiousness and lyrics gently mocking the indie scene of the time such as on "On Tape", "Indiepop Ain\'t Noise Pollution" and "I Know Someone Who Knows Someone Who Knows Alan McGee Quite Well". The band changed direction on their 1991 U.S breakthrough "The Great White Wonder", eschewing the \'twee\' British indie pop sound for a more American-styled power pop sound, akin to bands like Jellyfish and Redd Kross. Subsequent albums "Million Seller", released on 11 January 1993, considered by some power pop fans to be the band\'s best work, and "Optimistic Fool", released on 24 April 1995, followed in this style.', 'title': 'The Pooh Sticks'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"HandClap" is a song recorded by American indie pop band Fitz and The Tantrums. The song was released as the lead single from their self-titled album "Fitz and the Tantrums" on March 25, 2016 through Elektra Records. It is their highest-charting song on the "Billboard" Hot 100, peaking at number 53.', 'title': 'HandClap'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Saintmotelevision (stylized as saintmotelevision) is the second studio album by American indie pop band Saint Motel. It was released on October 21, 2016, by Elektra Records.', 'title': 'Saintmotelevision'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Fitz and The Tantrums (FATT) is an American indie pop and neo soul band from Los Angeles that formed in 2008. The band consists of Michael Fitzpatrick (lead vocals), Noelle Scaggs (co-lead vocals and percussion), James King (saxophone, flute, keyboard, percussion and guitar), Joseph Karnes (bass guitar), Jeremy Ruzumna (keyboards) and John Wicks (drums and percussion). Their debut studio album, "Pickin\' Up the Pieces", was released in August 2010 on indie label Dangerbird Records and received critical acclaim. It reached No.\xa01 on the "Billboard" Heatseekers chart. The band signed to their current label Elektra Records in early 2013 and went on to release their sophomore LP, "More Than Just a Dream," on May 7, 2013. Their self-titled third album was released on June 10, 2016.', 'title': 'Fitz and The Tantrums'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Saint Motel is an American indie pop band from Los Angeles, whose music has been described as everything from "dream pop" to "indie prog". The band consists of A/J Jackson (lead vocals, guitar, piano), Aaron Sharp (lead guitar), Dak Lerdamornpong (bass), and Greg Erwin (drums).', 'title': 'Saint Motel'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Mexican Spitfires were an Australian indie rock–indie pop band formed in 1986. The original lineup consisted of Price Conlan on drums, Stephen McCowage on lead guitar, Tim O\'Reilly on bass and vocals, Michael Quinlan on rhythm guitar and vocals. O\'Reilly, Quinlan and McCowage had all played in a psychedelic 1960s-styled indie pop band, Prince Vlad & the Gargoyle Impalers. They recorded two extended plays, "Lupe Velez" (1988) and "Elephant" (1990); however, they had disbanded late in 1989.', 'title': 'The Mexican Spitfires'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Yangzhong () is a county-level city under the administration of Zhenjiang, Jiangsu province, China. It is the easternmost county-level division of Zhenjiang City.', 'title': 'Yangzhong'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Altanochir (1882–1949) was an Inner Mongolian prince, politician, and general under the Republic of China and Mengjiang governments. He served as deputy head of Yeke-juu League (today Ordos City). An ethnic Mongol, he was a native of Right-Wing Rear Banner, Ordos (today administered as Hanggin Banner, Ordos City).', 'title': 'Altanochir (1882–1949)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Ordos Ejin Horo Airport (IATA: DSN,\xa0ICAO: ZBDS) is an airport serving Ordos City in China's Inner Mongolia Autonomous Region. It is located in Ejin Horo Banner. First built in 1959 and called Dongsheng Airport, the airport ceased operation in 1983. In 2005 the airport was rebuilt at the current site with an investment of 350 million yuan, and re-opened in July 2007.", 'title': 'Ordos Ejin Horo Airport'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Ordos Mongolian (also "Urdus"; Mongolian ᠣᠷᠳᠣᠰ ; Chinese 鄂尔多斯 "È\'ěrduōsī") is a variety of Central Mongolic spoken in the Ordos City region in Inner Mongolia and historically by Ordos Mongols. It is alternatively classified as a language within the Mongolic language family or as a dialect of the Central Mongolian Mongolian standard language. Due to the research of Antoine Mostaert, the development of this dialect can be traced back 100 years.', 'title': 'Ordos Mongolian'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The 2011 FIA GT1 Ordos round was an auto racing event held at the Ordos International Circuit, Ordos City, China on 2–4 September, and was the eighth round of the 2011 FIA GT1 World Championship season. It was the FIA GT1 World Championship\'s first race held in China, as well as at the 3.751 km Ordos. The event was supported by Formula Pilota, and the overall event was held under the title of the "Kangbashi Cup".', 'title': '2011 FIA GT1 Ordos round'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Sky Vision (Yuan-Jian or Yuanjian, 远见) UAVs are a series of Chinese UAVs developed by [ Beijing Sky Universe Digital City Science and Technology Co., Ltd. (Spaceware, 北京天宇数字城市科技有限公司)], and some of which are manufactured by its subsidiary Ordos City China Science Flying Universe Science and Technology Co., Ltd. (鄂尔多斯市中科飞宇科技有限公司)', 'title': 'Spaceware Sky Vision II'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Dalad Banner (Mongolian: ᠳᠠᠯᠠᠳ ᠬᠣᠰᠢᠭᠤ Далад қосиу "Dalad qosiɣu"; ) is a banner of western Inner Mongolia, People\'s Republic of China, lying on the southern (right) bank of the Yellow River. It is under the administration of Ordos City, although it is closer to the city of Baotou, 33 km to the north-northwest.', 'title': 'Dalad Banner'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The 2010 Ordos Superleague Formula round was a Superleague Formula round held on October 3, 2010, at the newly built Ordos International Circuit, Ordos City, China. It was Superleague Formula's first visit to China, and is followed the week after by a round through the streets of Beijing. It was the tenth round of the 2010 Superleague Formula season.", 'title': '2010 Ordos Superleague Formula round'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Ordos (Mongolian: Ордос қота "Ordos qota" ; ) is one of the twelve major subdivisions of Inner Mongolia, China. It lies within the Ordos Loop of the Yellow River. Although mainly rural, Ordos is administered as a prefecture-level city. Its administrative seat is situated in Dongsheng which had a population of 582,544 inhabitants as of the 2010 census. Another Banner is being urbanized quickly around the city of Ejin Horo with about 251,894 inhabitants at the 2010 census which is the seat of Ordos Airport.', 'title': 'Ordos City'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Ordos International Circuit(Chinese:鄂尔多斯国际赛车场), built in 2010, is a motorsport facility located in Kangbashi New Area, Ordos City, Inner Mongolia, China. It hosted a round of the China Touring Car Championship, Scirocco Cup China and Superleague Formula in 2010. The circuit is 3.751 km long with 18 corners.', 'title': 'Ordos International Circuit'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Old Dominion–VCU basketball rivalry is a college sports rivalry between the VCU Rams of Virginia Commonwealth University and the Old Dominion Monarchs of Old Dominion University. It is often regarded as the best college basketball rivalry in the Commonwealth of Virginia.', 'title': 'Old Dominion–VCU basketball rivalry'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Old Dominion Monarchs baseball team is a varsity intercollegiate athletic team of Old Dominion University in Norfolk, Virginia, United States. The team is a member of the Conference USA, which is part of NCAA Division I and just landed the number 1 left-handed pitching prospect in New Jersey, Joey Dechiaro. Old Dominion's first baseball team was fielded in 1931 as the William and Mary College – Norfolk Division Braves. ODU joined Division I in 1977. The team plays its home games at Bud Metheny Baseball Complex in Norfolk, Virginia where it has played since 1982. ODU has won 4 conference tournament titles and have been to the NCAA Tournament eight times. The Monarchs are coached by Chris Finwood, a native of Hampton, Virginia who is in his fourth year at the helm. The Monarchs have had eleven players reach the Major Leagues and one, Justin Verlander, has played in the World Series.", 'title': 'Old Dominion Monarchs baseball'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Valparaiso University is a regionally accredited private university located in Valparaiso, Indiana, United States. Commonly known as Valpo, the university is a coed, four-year, Lutheran institution that enrolls about 4,500 students from over 50 countries on a campus of 350 acre .', 'title': 'Valparaiso University'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Matthew John Quatraro (born November 14, 1973) is an American professional baseball player, coach, and manager. He is the assistant hitting coach for the Cleveland Indians of Major League Baseball. He played college baseball for Old Dominion University from 1993 through 1996, where he was named an All-American. Quatraro played professionally from 1996 through 2003, without reaching the majors. He began coaching in 2004, and was enshrined in the Old Dominion University Sports Hall of Fame that year.', 'title': 'Matt Quatraro'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Dr. Alan F. Harre (born 1940) was the eighteenth president of Valparaiso University, a post he held for 20 years from 1988 to 2008. He was succeeded by Elizabethtown College alumnus, Mark A. Heckler. Harre was designated President Emeritus of Valparaiso University on July 1, 2008 and was voted one of Valparaiso University's 150 most influential people in history by 2009.", 'title': 'Alan Harre'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The 2015 Old Dominion Monarchs football team represented Old Dominion University in the 2015 NCAA Division I FBS football season. They were led by seventh-year head coach Bobby Wilder and played their home games at Foreman Field at S. B. Ballard Stadium in Norfolk, Virginia. They were members of the East Division of Conference USA. 2015 was the first year Old Dominion was a full member of the NCAA Division I Football Bowl Subdivision (FBS) and eligible for postseason play. They finished the season 5–7, 3–5 in C-USA play to finish in a three-way tie for fourth place in the East Division.', 'title': '2015 Old Dominion Monarchs football team'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Dr. Dwight W. Allen (born 1931) is a professor of education, eminent scholar, and lifelong education reformist. He served as a professor and Director of Teacher Education at his "alma mater", the Stanford Graduate School of Education from 1959 to 1967. He was Dean of the College of Education, University of Massachusetts, Amherst, from 1968-1975. In 1978, Allen became a Professor of Education and Eminent Scholar of Educational Reform at Old Dominion University in Virginia. Allen retired from Old Dominion University in July 2008.', 'title': 'Dwight W. Allen'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Old Dominion University Fieldhouse was a 5,200 seat multi-purpose arena in Norfolk, Virginia. It opened in 1970. It was home to the Old Dominion University Monarchs and Lady Monarchs basketball teams until the 2002-03 basketball season, when the Ted Constant Convocation Center opened.', 'title': 'Old Dominion University Fieldhouse'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Foreman Field at S. B. Ballard Stadium is a 20,118-seat multi-purpose stadium on the campus of Old Dominion University in Norfolk, Virginia. It opened in 1936 with a football game between the University of Virginia and the College of William & Mary's Norfolk Division (which is now Old Dominion University). It is currently being used to house Old Dominion Monarchs football games, along with the Monarch Marching Band", 'title': 'Foreman Field'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "Old Dominion University, also known as ODU, is a public, co-educational research university located in Norfolk, Virginia, United States, with two satellite campuses in the Hampton Roads area. It was established in 1930 as the Norfolk Division of the College of William & Mary and is now one of the largest universities in Virginia with an enrollment of 24,670 students for the 2014-2015 academic year. Its campus covers over 251 acre straddling the city neighborhoods of Larchmont, Highland Park, and Lambert's Point, approximately 5 mi from Downtown Norfolk.", 'title': 'Old Dominion University'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Uterine cancer or womb cancer is any type of cancer that emerges from the tissue of the uterus. It can refer to several types of cancer, with cervical cancer (arising from the lower portion of the uterus) being the most common type worldwide and the second most common cancer in women in developing countries. Endometrial cancer (or cancer of the inner lining of the uterus) is the second most common type, and fourth most common cancer in women from developed countries. Risk factors depend on specific type, but obesity, older age, and human papillomavirus infection add the greatest risk of developing uterine cancer. Early on, there may be no symptoms, but irregular vaginal bleeding, pelvic pain or fullness may develop. If caught early, most types of uterine cancer can be cured using surgical or medical methods. When the cancer has extended beyond the uterine tissue, more advanced treatments including combinations of chemotherapy, radiation therapy, or surgery may be required.', 'title': 'Uterine cancer'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Treason is criminal disloyalty. Historically, in common law countries, high treason is treason against the state. It was differentiated from petty treason (or "petit" treason), which was treason against a lesser lawful superior (such as a servant killing his master). Petty treason was restricted to cases of homicide in 1351, and came to be considered a more serious degree of murder.', 'title': 'High treason'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Petty treason or petit treason was an offence under the common law of England which involved the betrayal (including murder) of a superior by a subordinate. It differed from the better-known high treason in that high treason can only be committed against the Sovereign. In England and Wales, petty treason ceased to be a distinct offence from murder by virtue of the Offences against the Person Act 1828. It was abolished in Ireland in 1829. It never existed in Scotland. It has also been abolished in other common-law countries.', 'title': 'Petty treason'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'J. T. Petty (born February 28, 1977 in Raleigh, North Carolina) is an American filmmaker and video game writer. Petty\'s film and short novels contain elements of the horror genre. He wrote the Ubisoft video game, "Tom Clancy\'s Splinter Cell" as well as the survival horror games "Outlast" and "Outlast 2". He currently resides in Brooklyn, New York .', 'title': 'J. T. Petty'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'M Music & Musicians (alternatively known as Music & Musicians and often shortened to just M) is an American magazine based out of Redondo Beach, California, that covers the music industry. It was established in November 2009. The central management team is made up of Merlin David (formerly of "Performing Songwriter"), editor Rick Taylor ("Performing Songwriter", American Media, Inc.), creative director Terrill Thomas (T13 Media, AtomFilms), senior editor Chris Neal ("Performing Songwriter", American Media, Inc.), technology editor Doug Doppler and photographer Kent Kallberg. According to its initial press release, ""M" matches first-class features, interviews and reviews with a new distribution model" and offers "insightful, in-depth coverage from rock, pop and hip-hop to R&B, country, folk and jazz." Alicia Keys was featured on the cover of the first issue, dated January/February 2010. Subsequent cover-story subjects have included Sting, Ringo Starr, Tom Petty, Mary J. Blige and Sheryl Crow. The "Encore" section regularly features work from archives of veteran rock photographers such as Henry Diltz and Norman Seeff.', 'title': 'M Music &amp; Musicians'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The imprest system is a form of financial accounting system. The most common imprest system is the petty cash system. The base characteristic of an imprest system is that a fixed amount is reserved, which after a certain period of time or when circumstances require, because money was spent, it will be replenished. This replenishment will come from another account source, e.g., petty cash will be replenished by cashing a cheque drawn on a bank account.', 'title': 'Imprest system'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Kegelhelm (German: "cone helm") or Kegel type is a type of helmet. It is an open-faced helmet of roughly conical shape, sometimes with extensions at the sides to protect the cheeks, or a crest-holder on top. It was made of bronze, sometimes in several pieces. It was the progenitor of many Greek helmets, especially the "Illyrian" type helmet. It did not outlast the eighth century BC.', 'title': 'Kegelhelm'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'W. Morgan Petty is the creation of Brian Bethell. W. Morgan Petty would write crank letters to numerous organizations expressing typical concerns for mid-1980s Britain like nuclear war and the common market. Collections of his letters include:', 'title': 'W. Morgan Petty'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Outlast is a first-person survival horror video game developed and published by Red Barrels. The game revolves around a freelance investigative journalist, Miles Upshur, who decides to investigate a remote psychiatric hospital named Mount Massive Asylum, located deep in the mountains of Lake County, Colorado. The downloadable content, "Outlast: Whistleblower", centers on Waylon Park, the man who led Miles there in the first place.', 'title': 'Outlast'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'In common law, a petit jury (or trial jury, sometimes petty jury) hears the evidence in a trial as presented by both the plaintiff (petitioner) and the defendant (respondent). After hearing the evidence and often jury instructions from the judge, the group retires for deliberation, to consider a verdict. The majority required for a verdict varies. In some cases it must be unanimous, while in other jurisdictions it may be a majority or supermajority. A jury that is unable to come to a verdict is referred to as a hung jury. The size of the jury varies; in criminal cases involving serious felonies there are usually 12 jurors, although Scotland uses 15. A number of countries that are not in the English common law tradition have quasi-juries on which lay judges or jurors and professional judges deliberate together regarding criminal cases. However, the common law trial jury is the most common type of jury system.', 'title': 'Petit jury'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Mingus Mountain Academy is a private, all-girls alternative high school in Prescott Valley, Arizona, United States. It is operated by Sequel Youth and Family Services. It is one of three Arizona Interscholastic Association-member single-sex high schools, along with Brophy College Preparatory/Xavier College Preparatory. Mingus Mountain Academy is also a behavioral treatment center for troubled youth. Many girls who attend the academy have come from Juvenile Hall, the streets, or past placements. This treatment facility offers girls skills to use after they leave Mingus.', 'title': 'Mingus Mountain Academy'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Tshepo means hope in Sesotho, Sepedi, and in Setswana it means \'Trust\'. The name is derived from \'tshepa\' which means trust (all Sotho languages used in Southern Africa, particularly in Botswana, Lesotho, and South Africa). In Sesotho the name is spelled Tsepo, without an "h" though in pronunciation it sounds the same as in Sepedi and Setswana. It is a common name for boys. Many girls are named Matshepo, which literally means mother of hope. This gendered difference is only meant to give a sense of respect and dignity to women whose name is derived from Tshepo. But many families simply name their daughters Tshepo. Tshepo is commonly translated in Sotho and Sepedi as also meaning trust. However, the name trust in Sesotho is also Tshepile, not to be confused with Tshepiso which means promise and faith is Tumelo. For Setswana speakers hope is Tsholofelo.', 'title': 'Tshepo'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Counting On (formerly Jill & Jessa: Counting On) is an American reality television show that has aired on the cable channel TLC since 2015. A spin-off show of "19 Kids and Counting", it features the Duggar family: Jill Dillard, Jessa Seewald, sixteen of their seventeen siblings, and parents Jim Bob and Michelle Duggar. The show was created in the wake of the Josh Duggar molestation controversy and subsequent cancellation of 19 Kids and Counting.', 'title': 'List of Counting On episodes'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "St. Ursula's College is an independent, private secondary girls' school in Toowoomba, Queensland, Australia. A Catholic school, it was established in 1931 by Ursuline nuns. The school is heavily influenced by the teachings of Saint Angela Merici. Many of the school's buildings are named after Italian cities and places such as Brescia and Lake Garda that were part of Merici's life. It enrols both boarding students and day students, and attracts many girls from remote locations throughout Queensland and New South Wales as boarders.", 'title': "St Ursula's College, Toowoomba"}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': '19 Kids and Counting (formerly 17 Kids and Counting and 18 Kids and Counting) is an American reality television show that aired on the cable channel TLC for seven years until its cancellation in 2015. The show features the Duggar family: parents Jim Bob and Michelle Duggar and their 19 children—nine girls and 10 boys, all of whose names begin with the letter "J". During the life of the show, three children were born, three children were married and four grandchildren born.', 'title': '19 Kids and Counting'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The hillstream loaches or river loaches are a family, the Balitoridae, of small fish from South, Southeast and East Asia. The family includes about 99 species. They are sometimes sold as "lizardfish" or (in Germany) "flossensaugers". Many of the species are popular for aquaria. They have a number of similarities with the Cobitidae, their sibling family of "loaches", such as multiple barbels around the mouth. They should not be confused with the loricariids, which look similar but are a family of catfish.', 'title': 'Hillstream loach'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Chris Burnett (born Christopher LeRoy Burnett on November 2, 1955) is an American saxophone player, composer, veteran of US military jazz bands and band leader. Born in Olathe, Kansas, Burnett's family moved relatively frequently during his early childhood due to his father being a member of the active US military service. His sibling family lived at places such as: France, Michigan, and Colorado prior to settling permanently back home in the Kansas City metro area. His brother, Richie Pratt (March 11, 1943 – February 12, 2015), who was also a musician (Lionel Hampton, Junior Mance, Aretha Franklin, New York Jazz Quartet, Broadway, films, studios ...), and the eldest sibling in his family continually served as a significant professional role model and mentor.", 'title': 'Chris Burnett'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Norwich Canoe Club is based at Whitlingham, Trowse in Norwich, Norfolk, UK with Whitlingham Great Broad, Whitlingham Little Broad, River Yare and River Wensum on its doorstep. It is a canoe and kayak racing club that focuses on flatwater sprint canoeing and marathon canoeing. It is a friendly club where canoeing is safe and fun and welcomes anyone who wants to have a go on the water. The club has as many girls as boys and as many women as men and also lots of families who all come and paddle together. Members are all ages, from 7 to 70 so there is definitely a place for everyone.', 'title': 'Norwich Canoe Club'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Lights Out is the 9-volume manhwa written by Lee Myung-jin, the author of Ragnarok. This manhwa is about the high school student Nam Gung Geon, a violent transfer student from the Chi Jon High School to Puk Ye High School. His life is changed by meeting Min Seung-Ah, the land-lady of the inn named "Fate", granddaughter of the inn owner, and also a beautiful girl. In the last of the story, Geon meets many friends such as Sin Na-Rae, Kim Mi-Na, Ji-Ae, Kim Tae-Min, Son Seo-Ho, etc. and many girls have a crush of him because he wins the 2nd award of the Motor Grandprix.', 'title': 'Lights Out (manhwa)'}]

