[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Washington Daily News is a daily newspaper serving Washington, North Carolina. It is the smallest daily newspaper to ever win a Pulitzer Prize gold medal.', 'title': 'Washington Daily News'}
