 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Erie County Holding Center in Buffalo, New York is a pre-trial, maximum security detention facility that serves Erie County. Capable of housing 680 inmates, it is the second largest detention facility in New York State outside of New York City. Inmate "Over-flow" is housed at the Holding Center Annex at the Erie County Correctional Facility in Alden, New York. The Jail Management Division of the Erie County Sheriff\'s Office conducts regularly scheduled tours of the facility for high school and college student groups, police academy classes and groups of "At risk" teens. According to a professor at University at Buffalo Law School, "Erie County continues to operate the Holding Center with indifference to the basic medical needs of inmates."', 'title': 'Erie County Holding Center'}
