 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Times Publishing Company is a newspaper and magazine publisher. Its flagship publication is the "Tampa Bay Times" (formerly the "St. Petersburg Times"), a daily newspaper serving the Tampa Bay area. It also publishes the business magazine "Florida Trend" and the daily newspaper "tbt*".', 'title': 'Times Publishing Company'}
