 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Salem News (formerly the Salem Evening News) is an American daily newspaper serving southern Essex County, Massachusetts. Although the paper is named for the city of Salem, its offices are now in nearby Beverly, Massachusetts. The newspaper is published Monday through Saturday afternoons by Eagle-Tribune Publishing Company, a subsidiary of Community Newspaper Holdings Inc.', 'title': 'The Salem News'}
