[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Raiders of the Lost Ark: Original Motion Picture Soundtrack is the film score to the 1981 Steven Spielberg film, "Raiders of the Lost Ark". The music was composed and conducted by John Williams, and performed by the London Symphony Orchestra. Orchestrations were done by Herbert W. Spencer with additional orchestrations done by Al Woodbury. The score was released by Columbia Records in June 1981. The soundtrack received an Academy Award nomination for Best Original Score, but lost out to Vangelis\' score for "Chariots of Fire".', 'title': 'Raiders of the Lost Ark (soundtrack)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Lodger is a 2009 mystery/thriller film directed by David Ondaatje and starring Alfred Molina, Hope Davis and Simon Baker. It is based on the novel "The Lodger" by Marie Belloc Lowndes, filmed previously by Alfred Hitchcock in 1927, by Maurice Elvey in 1932, by John Brahm in 1944, and as "Man in the Attic" (1953) directed by Hugo Fregonese.', 'title': 'The Lodger (2009 film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Raiders of the Lost Car Park is a novel by British author Robert Rankin. It is the second book in the Cornelius Murphy trilogy, sequel to "The Book of Ultimate Truths" and prequel to "The Most Amazing Man Who Ever Lived". It documents the continuing adventures of Cornelius Murphy and his companion Tuppe. The novel was first published by Doubleday in 1994. The book\'s name is a play on "Raiders of the Lost Ark", an Indiana Jones movie.', 'title': 'Raiders of the Lost Car Park'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Jungle Raiders, also known as Captain Yankee (in original Italian, La leggenda del rubino malese/ "Legend of the Blonde Malaysian") is a 1985 Cannon Film. This film by Antonio Margheriti stars Christopher Connelly and Lee Van Cleef. The film was the third of three films Antonio Margheriti made in which he attempted to copy the success of "Raiders of the Lost Ark" (the first films he made were "Hunters of the Golden Cobra" and "Ark of the Sun God").', 'title': 'Jungle Raiders (1985 film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Nicole Maurey (20 December 1925 – 11 March 2016) was a French actress, who has appeared in 65 film and television productions between 1945 and 1997. Born in Bois-Colombes, a northwestern suburb of Paris, she was originally a dancer before being cast in her first film role in 1944. She remains most noted as Charlton Heston\'s leading lady in "Secret of the Incas" (1954), often cited as the primary inspiration for "Raiders of the Lost Ark" (1981). She starred in films with Alec Guinness, Bette Davis, Bing Crosby, Jeff Chandler, Fess Parker, Rex Harrison, Robert Taylor and Mickey Rooney, among numerous others. She was the leading lady in the original 1962 science fiction cult film "The Day of the Triffids". Later in life, she moved into television, appearing in various made-for-TV movies and mini-series.', 'title': 'Nicole Maurey'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Raiders of the Lost Ark (also known as Indiana Jones and the Raiders of the Lost Ark) is a 1981 American action adventure film directed by Steven Spielberg, with a screenplay written by Lawrence Kasdan, from a story by George Lucas and Philip Kaufman. It was produced by Frank Marshall for Lucasfilm Ltd., with Lucas and Howard Kazanjian as executive producers. Starring Harrison Ford, it was the first installment in the "Indiana Jones" film franchise to be released, though it is the second in internal chronological order. It pits Indiana Jones (Ford) against a group of Nazis who are searching for the Ark of the Covenant, which Adolf Hitler believes will make his army invincible. The film co-stars Karen Allen as Indiana\'s former lover, Marion Ravenwood; Paul Freeman as Indiana\'s rival, French archaeologist René Belloq; John Rhys-Davies as Indiana\'s sidekick, Sallah; Ronald Lacey as Gestapo agent Arnold Toht; and Denholm Elliott as Indiana\'s colleague, Marcus Brody.', 'title': 'Raiders of the Lost Ark'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Michael Pangrazio (commonly credited as Mike Pangrazio) is an award-winning American art director in the feature film industry best known for his matte painting work on Raiders of the Lost Ark and The Empire Strikes Back. As traditional and digital matte artist, he created some of the most famous matte paintings in movie history. His best known painting is the Raiders of the Lost Ark warehouse interior set-extension at the end of the movie.', 'title': 'Michael Pangrazio'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Alfredo "Alfred" Molina (born 24 May 1953) is an English-American actor, known for his roles in "Raiders of the Lost Ark" (1981), "Enchanted April" (1992), "Maverick" (1994), "Boogie Nights" (1997), "Chocolat" (2000), "Spider-Man 2" (2004), "The Da Vinci Code" (2006), "An Education" (2009), "" (2010), "The Sorcerer\'s Apprentice" (2010), "Rango" (2011) and "Whiskey Tango Foxtrot" (2016).', 'title': 'Alfred Molina'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Marion Ravenwood is a fictional character that first appeared in the 1981 film "Raiders of the Lost Ark". Played by Karen Allen, she enters the story when Indiana Jones visits her in Nepal, needing her help to locate the Ark of the Covenant with a possession originally obtained by her father, Dr. Abner Ravenwood. After 27 years of absence (21 years in the films\' internal chronology), the character returned in "Indiana Jones and the Kingdom of the Crystal Skull", and was once again played by Allen.', 'title': 'Marion Ravenwood'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Raiders of the Lost Ark: The Adaptation is a 1989 American fan film, made as a shot-for-shot remake of the 1981 Indiana Jones adventure film "Raiders of the Lost Ark". Using the original film\'s screenplay and score, it principally starred and was filmed, directed, and produced over a seven-year period by three Mississippi teenagers (Chris Strompolos, Eric Zala, and Jayson Lamb).', 'title': 'Raiders of the Lost Ark: The Adaptation'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Lupin the Third: The Woman Called Fujiko Mine (LUPIN the Third -峰不二子という女- , Rupan za Saado Mine Fujiko to Iu Onna ) is the fourth incarnation of TMS Entertainment\'s long-running anime television adaptation of the "Lupin III" manga series written by Monkey Punch. Directed by Sayo Yamamoto, it aired on NTV from April 4, 2012 to June 27, 2012. It focuses on the franchise\'s heroine, Fujiko Mine, as she undergoes various missions and encounters the rest of the "Lupin III" cast for the first time. Unlike the franchise\'s previous three televised anime, "The Woman Called Fujiko Mine" is more sexually oriented in order to capture the "sensuality" present in the original manga as well as darker and more serious. It is also the only installment in the franchise to be directed by a woman and the first in which Lupin is not the protagonist.', 'title': 'Lupin the Third: The Woman Called Fujiko Mine'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The California Birth Index (CABI) is a database compiled by the California Office of Health Information and Research. The index contains birth records of all registered births in California between 1905 and 1995. Each record is an abstract of a person's birth certificate, including date of birth, full name, county of birth, gender, and mother's maiden name. People who have been adopted are sometimes listed by their birth name, sometimes listed by their adopted name, sometimes by both and sometimes not listed at all. The CABI is considered a valuable genealogy tool but is also criticized for privacy issues. California began statewide civil registration of births on July 1, 1905. Earlier birth records may exist in the county where the birth took place or at the church where a baptism took place.", 'title': 'California Birth Index'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Finding of Moses, sometimes called Moses in the Bullrushes, Moses Saved from the Waters, or other variants, is the story in chapter 2 of the Book of Exodus in the Hebrew Bible of the finding in the River Nile of Moses as a baby by the daughter of Pharoah. The story became a common subject in art, especially from the Renaissance onwards.', 'title': 'Finding of Moses'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Elf is the first album by Ronnie James Dio\'s blues rock band called Elf. Produced by Ian Paice and Roger Glover of Deep Purple, the record was released in 1972. In this album, Dio is listed by his birth name Ronald Padavona. Though Dio had used "Padavona" for songwriting credits on earlier singles, Dio explained in an interview in 1994 that he used his birth name on this album as a tribute to his parents so that they could see their family name on an album at least once.', 'title': 'Elf (album)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Father Mogue Kearns (Irish: "Mo Aodh Óg Ó Céirín" ; died 12 July 1798), sometimes called Moses Kearns, was an Irish Roman Catholic priest and United Irishmen executed by the British on 12 July 1798, after leading 2,000 rebel troops during the 1798 Rebellion in Ireland.', 'title': 'Mogue Kearns'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Tobias Hainyeko constituency is the name of an electoral constituency in Windhoek, the capital of Namibia. It was created in 2003 under the name Eastern Hakahana at the recommendation of the "Third Delimitation Commission" which suggested that the constituency of Hakahana be split. Since then, the suburb of Hakahana falls into two different constituencies. In 2008 the constituency was named after the guerrilla war hero Tobias Hainyeko. The western part of Hakahana is now called Moses ǁGaroëb constituency, after politician Moses ǁGaroëb.', 'title': 'Tobias Hainyeko constituency'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Harriet, the Woman Called Moses is an opera in two acts composed by Thea Musgrave who also wrote the libretto which is loosely based on episodes in the life of the American abolitionist and former slave Harriet Tubman. The opera premiered on 1 March 1985 in Norfolk, Virginia, performed by Virginia Opera with subsequent broadcasts of the Virginia Opera production on National Public Radio and BBC Radio 3. Musgrave later wrote two shortened versions of the opera—The Story of Harriet Tubman (premiered 1993) and Remembering Harriet (premiered 2006).', 'title': 'Harriet, the Woman Called Moses'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Mental As Anything are an Australian new wave/pop-rock band that formed in Sydney in 1976. Its most popular line-up (which lasted from 1977-1999) was Martin Plaza (birth name Martin Murphy) on vocals and guitar; Reg Mombassa (birth name Chris O\'Doherty) on lead guitar and vocals; his brother Peter "Yoga Dog" O\'Doherty on bass guitar and vocals; Wayne de Lisle (birth name David Twohill) on drums; and Andrew "Greedy" Smith on vocals, keyboards and harmonica. Their original hit songs were generated by Mombassa, O\'Doherty, Plaza and Smith, either individually or collectively; they also hit the Australian charts with covers of songs by Roy Orbison, Elvis Presley and Chuck Berry.', 'title': 'Mental As Anything'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Harriet Tubman (born Araminta Ross; \u20091822 March 10, 1913) was an American abolitionist, humanitarian, and an armed scout and spy for the United States Army during the American Civil War. Born into slavery, Tubman escaped and subsequently made some thirteen missions to rescue approximately seventy enslaved people, family and friends, using the network of antislavery activists and safe houses known as the Underground Railroad. She later helped abolitionist John Brown recruit men for his raid on Harpers Ferry, and in the post-war era was an active participant in the struggle for women's suffrage.", 'title': 'Harriet Tubman'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'A Woman Called Moses is a television miniseries based on the life of Harriet Tubman, the escaped African American slave who helped to organize the Underground Railroad, and who led dozens of African Americans from enslavement in the Southern United States to freedom in the Northern states and Canada. Narrated by Orson Welles, the production was broadcast on the NBC television network on December 11 and 12, 1978. Tubman was portrayed by Cicely Tyson.', 'title': 'A Woman Called Moses'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Attorney General of Sri Lanka is the Sri Lankan government's chief legal adviser, and its primary lawyer in the Supreme Court of Sri Lanka. The Attorney General is usually a highly respected Senior Advocate, and is appointed by the ruling government. The current Attorney General is Jayantha Jayasuriya. The president does not have any power to make orders, mandatory or otherwise, to the attorney general. He heads the Attorney General's Department.", 'title': 'Attorney General of Sri Lanka'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Kurt Schaefer (born October 27, 1965) is a former Republican member of the Missouri Senate, representing the 19th District from 2009–2017. In 2016, Schaefer ran against Josh Hawley for Missouri Attorney General, but was defeated for the Republican nomination in the August 2 primary.', 'title': 'Kurt Schaefer'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Her Majesty's Attorney General for England and Wales, usually known simply as the Attorney General, is one of the Law Officers of the Crown. Along with the subordinate Solicitor General for England and Wales, the Attorney General serves as the chief legal adviser of the Crown and its government in England and Wales. The current Attorney General is Jeremy Wright.", 'title': 'List of Attorneys General for England and Wales'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Attorney General of Bangladesh (Bengali: মহাব্যবহারদেশক, Mahābyabahāradēśaka ) is the Bangladeshi government's chief legal adviser, and its primary lawyer in the Supreme Court of Bangladesh. The Attorney General is usually a highly respected Senior Advocate, and is appointed by the ruling government. The current Attorney General is Mahbubey Alam. The Attorney General is the ex-officio chairman of the Bangladesh Bar Council and accordingly he performs the duties assigned to that post and empowered to participate in any reference to Supreme Court made by the President under article 106 of the Constitution and can express his own opinion.", 'title': 'Attorney General of Bangladesh'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Attorney General of the Union, or Solicitor General, (Portuguese: "Advogado-Geral da União" , AGU) is a cabinet-level position in the Brazilian government charged with advising the Executive Branch and representing the federal government of Brazil in legal proceedings. The Attorney General is defined under Article 131 of the Brazilian Constitution as one of the essential functions of Brazilian judicial administration, along with the roles performed by the judicial branch, the Prosecutor\'s office, the public defenders and private lawyers. The current Attorney General is Grace Mendonça.', 'title': 'Attorney General of Brazil'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Office of the Attorney General of Colombia (Spanish: "Fiscalía General de la Nación" ; literally "General Prosecutorial Office of the Nation") is the Colombian institution part of the Colombian judicial branch of Government with administrative autonomy designed to prosecute offenders, investigate crimes, review judicial processes and accuse penal law infractions against judges and courts of justice. The Office of the Attorney General was created by the Colombian Constitution of 1991 and began operating on July 1, 1992. The current Attorney General is Néstor Humberto Martínez.', 'title': 'Office of the Attorney General of Colombia'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Her Majesty's Attorney General for England and Wales, usually known simply as the Attorney General, is one of the Law Officers of the Crown. Along with the subordinate Solicitor General for England and Wales, the Attorney General serves as the chief legal adviser of the Crown and its government in England and Wales. The current Attorney General is Jeremy Wright, MP.", 'title': 'Attorney General for England and Wales'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Joshua David Hawley (born December 31, 1979) is an American lawyer and politician who serves as the 42nd and current Attorney General of Missouri.', 'title': 'Josh Hawley'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Peter K. Michael is the current Attorney General of Wyoming. The former Attorney General Gregory A. Phillips appointed him Chief Deputy Attorney General on May 1, 2011. Michael took over as acting-Attorney General on July 9, 2013, and succeeded him officially on September 6, 2013. His term of office is 4 years.', 'title': 'Peter K. Michael'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Robert Watson Ferguson (born February 23, 1965) is an American attorney and politician who is the 18th and current Attorney General of Washington, serving since 2013. He was first elected Attorney General in 2012, and reelected in 2016. Prior to serving as Attorney General, Ferguson was a member of the King County Council. Ferguson is a member of the Democratic Party.', 'title': 'Bob Ferguson (politician)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Pyotr Ilyich Tchaikovsky's Piano Concerto No. 2 in G major, Op. 44, was written in 1879–1880. It was dedicated to Nikolai Rubinstein, who had insisted he be allowed to perform it at the premiere as a way of making up for his harsh criticism of Tchaikovsky's First Piano Concerto. Rubinstein was destined never to play it, however, as he died in March 1881. The premiere performance took place in New York City, on 12\xa0November 1881. The soloist was Madeline Schiller, and Theodore Thomas conducted the New York Philharmonic orchestra. The first Russian performance was in Moscow in May 1882, conducted by Anton Rubinstein with Tchaikovsky's pupil, Sergei Taneyev, at the piano.", 'title': 'Piano Concerto No. 2 (Tchaikovsky)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 1917 Petipa/Ivanov/Drigo revival of Swan Lake is a famous version of the ballet "Swan Lake", (ru. " Лебединое Озеро"), (fr. "Le Lac des Cygnes"). This is a ballet by Pyotr Ilyich Tchaikovsky based on an ancient German legend, presented in either four acts, four scenes (primarily outside Russia and Eastern Europe), three acts, four scenes (primarily in Russia and Eastern Europe) or, more rarely, in two acts, four scenes. Originally choreographed by Julius Reisinger to the music of Pyotr Ilyich Tchaikovsky (opus 20), it was first presented as "The Lake of the Swans" by the Ballet of the Moscow Imperial Bolshoi Theatre on 20 February/4 March 1877 (Julian/Gregorian calendar dates) in Moscow, Russia. Although the ballet is presented in many different versions, most ballet companies today base their stagings both choreographically and musically on this revival by Marius Petipa and Lev Ivanov, staged for the Imperial Ballet, first presented on 15 January/27 January 1895, at the Imperial Mariinsky Theatre in St. Petersburg, Russia instead of the original version.', 'title': 'Swan Lake (1895)'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Pyotr Ilyich Tchaikovsky ( ; Russian: Пётр Ильи́ч Чайко́вский ; 25 April/7 May 1840\xa0– 25 October/6 November 1893), often anglicized as Peter Ilich Tchaikovsky, was a Russian composer of the romantic period, some of whose works are among the most popular music in the classical repertoire. He was the first Russian composer whose music made a lasting impression internationally, bolstered by his appearances as a guest conductor in Europe and the United States. Tchaikovsky was honored in 1884, by Emperor Alexander III, and awarded a lifetime pension.', 'title': 'Pyotr Ilyich Tchaikovsky'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Kamarinskaya (Russian: камаринская ) is a Russian traditional folk dance, which is mostly known today as the Russian composer Mikhail Glinka\'s composition of the same name. Glinka\'s "Kamarinskaya", written in 1848, was the first orchestral work based entirely on Russian folk song and to use the compositional principles of that genre to dictate the form of the music. It became a touchstone for the following generation of Russian composers ranging from the Western-oriented Pyotr Ilyich Tchaikovsky to the group of nationalists known collectively as The Five and was also lauded abroad, most notably by French composer Hector Berlioz.', 'title': 'Kamarinskaya'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The International Tchaikovsky Competition is a classical-music competition held every four years in Moscow, Russia, for pianists, violinists, and cellists between 16 and 32 years of age, and singers between 19 and 32 years of age. The competition is named after Russian composer Pyotr Ilyich Tchaikovsky and is an active member of the World Federation of International Music Competitions.', 'title': 'International Tchaikovsky Competition'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Symphony No. 2 in E minor, Op. 27 is a symphony by the Russian composer Sergei Rachmaninoff, written in 1906–07. The premiere was conducted by the composer himself in Saint Petersburg on 8\xa0February 1908. Its duration is approximately 60 minutes when performed uncut; cut performances can be as short as 35 minutes. The score is dedicated to Sergei Taneyev, a Russian composer, teacher, theorist, author, and pupil of Pyotr Ilyich Tchaikovsky. Alongside his Piano Concerto No. 2 and Piano Concerto No. 3, this symphony remains one of the composer's best known compositions.", 'title': 'Symphony No. 2 (Rachmaninoff)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Pietro Alessandro Gaspare Scarlatti (2 May 1660 – 22 October 1725) was an Italian Baroque composer, especially famous for his operas and chamber cantatas. He is considered the founder of the Neapolitan school of opera. He was the father of two other composers, Domenico Scarlatti and Pietro Filippo Scarlatti.', 'title': 'Alessandro Scarlatti'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Tchaikovsky (Russian: Чайковский ) is a 1970 Soviet biopic film directed by Igor Talankin. It featured Innokenty Smoktunovsky in the role of the famous Russian composer Pyotr Ilyich Tchaikovsky. It was nominated for the 1971 Academy Award for Best Foreign Language Film as well as the Academy Award for Original Song Score and Adaptation.', 'title': 'Tchaikovsky (film)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Chaikovskij (sometimes Tchaikovsky) is a crater on Mercury. It has a diameter of 165 kilometers. Its name was adopted by the International Astronomical Union in 1976. Chaikovskij is named for the Russian composer Pyotr Ilyich Tchaikovsky, who lived from 1840 to 1893.', 'title': 'Chaikovskij (crater)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The Piano Sonata in C-sharp minor, Op. posth. 80, was written by Russian composer Pyotr Ilyich Tchaikovsky in 1865, his last year as a student at the St Petersburg Conservatory. The sonata in its original form was not published in Tchaikovsky's lifetime; it was published in 1900 by P. Jurgenson, and given the posthumous opus number 80.", 'title': 'Piano Sonata in C-sharp minor (Tchaikovsky)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Tonic water (or Indian tonic water) is a carbonated soft drink in which quinine is dissolved. Originally used as a prophylactic against malaria, tonic water usually now has a significantly lower quinine content and is consumed for its distinctive bitter flavour. It is often used in mixed drinks, particularly in gin and tonic.', 'title': 'Tonic water'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'In music theory, the key of a piece is the group of pitches, or scale that form the basis of a music composition in classical, Western art, and Western pop music. The group features a "tonic note" and its corresponding "chords", also called a "tonic" or "tonic chord", which provides a subjective sense of arrival and rest, and also has a unique relationship to the other pitches of the same group, their corresponding chords, and pitches and chords outside the group. Notes and chords other than the tonic in a piece create varying degrees of tension, resolved when the tonic note or chord returns. The key may be in the major or minor mode, though musicians assume major in a statement like, "This piece is in C." Popular songs are usually in a key, and so is classical music during the common practice period, around 1650–1900. Longer pieces in the classical repertoire may have sections in contrasting keys.', 'title': 'Key (music)'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Flaming beverages include cocktails and other mixed drinks that contain flammable, high-proof alcohol, which is ignited prior to consumption. The alcohol may be an integral part of the drink, or it may be floated as a thin layer across the top of the drink. The flames are mostly for dramatic flair. However, in combination with certain ingredients, the flavor of the drink is altered. Some flavors are enhanced, and it may impart a toasted flavor to some drinks.', 'title': 'Flaming beverage'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'A Lydian cadence is a type of half-cadence that was popular in the Ars nova style of the 14th and early 15th century. It is so-called because it evokes the Lydian mode based on its final chord as a tonic, and may be construed with the chord symbols VII♯ -I (if the final is taken as a Lydian-mode tonic) or III -IV (if the final is taken as a in major). It is also the most common type of double-leading-tone cadence, as it contains two leading-tone resolutions (♯ - and - ). A frequently-used type of Landini cadence is based on the Lydian cadence, with the upper voice dropping to before skipping back up to the tonic.', 'title': 'Lydian cadence'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Mário-Henrique Leiria (1923–1980) was a Portuguese surrealist poet. Born in Lisbon, he studied at the Escola de Belas Artes. He and his fellow surrealists were involved in an absurdist plot to overthrow the dictatorship of Antonio Salazar. He is best known for his books "Contos do Gin-Tonic" (Gin and Tonic Tales, 1973) and "Novos Contos do Gin" (More Gin Tales, 1974). He died in 1980.', 'title': 'Mário-Henrique Leiria'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'A gin and tonic is a highball cocktail made with gin and tonic water poured over ice. It is usually garnished with a slice or wedge of lime. The amount of gin varies according to taste. Suggested ratios of gin to tonic are between 1:1 and 1:3.', 'title': 'Gin and tonic'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Tequila and tonic, also known as TnT or Teqtonic, is a non-standard highball beverage. The drink is made with a 2:1 ratio of tonic water to tequila and is served with lemon or lime wedges on ice.', 'title': 'Tequila and tonic'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Tonality is the arrangement of pitches and/or chords of a musical work in a hierarchy of perceived relations, stabilities, attractions and directionality. In this hierarchy, the individual pitch or triadic chord with the greatest stability is called the tonic. The root of the tonic chord forms the name given to the key; so in the key of C major, the note C is both the tonic of the scale and the root of the tonic chord (C–E–G). Simple folk music songs often start and end with the tonic note. The most common use of the term "is to designate the arrangement of musical phenomena around a referential tonic in European music from about 1600 to about 1910" . Contemporary classical music from 1910 to the 2000s may practice or avoid any sort of tonality—but harmony in almost all Western popular music remains tonal. Harmony in jazz includes many but not all tonal characteristics of the European common practice period, sometimes known as "classical music".', 'title': 'Tonality'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'A bittering agent is a flavoring agent added to a food or beverage to impart a bitter taste, possibly in addition to other effects. While many substances are bitter to a greater or lesser degree, a few substances are used specifically for their bitterness, especially to balance other flavors, such as sweetness. Notable beverage examples include caffeine, found naturally in tea and coffee and added to many soft drinks, hops in beer, and quinine in tonic water.', 'title': 'Bittering agent'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "A Sweet Melissa is a gin-based cocktail that was named by its creator, Daniel Bouie, after his wife Melissa Chabran Bouie. Sweet Melissa is made with gin, tonic water and a splash of Jack Daniel's in a short glass of ice. Care must be taken not to add too much whiskey to this gin & tonic beverage.", 'title': 'Sweet Melissa'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Draize Test is an acute toxicity test devised in 1944 by Food and Drug Administration (FDA) toxicologists John H. Draize and Jacob M. Spines. Initially used for testing cosmetics, the procedure involves applying 0.5mL or 0.5g of a test substance to the eye or skin of a restrained, conscious animal, and then leaving it for set amount of time before rinsing it out and recording its effects. The animals are observed for up to 14 days for signs of erythema and edema in the skin test, and redness, swelling, discharge, ulceration, hemorrhaging, cloudiness, or blindness in the tested eye. The test subject is commonly an albino rabbit, though other species are used too, including dogs. The animals are euthanized after testing if the test renders irreversible damage to the eye or skin. Animals may be re-used for testing purposes if the product tested causes no permanent damage. Animals are typically reused after a "wash out" period during which all traces of the tested product are allowed to disperse from the test site.', 'title': 'Draize test'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'A hydrostatic test is a way in which pressure vessels such as pipelines, plumbing, gas cylinders, boilers and fuel tanks can be tested for strength and leaks. The test involves filling the vessel or pipe system with a liquid, usually water, which may be dyed to aid in visual leak detection, and pressurization of the vessel to the specified test pressure. Pressure tightness can be tested by shutting off the supply valve and observing whether there is a pressure loss. The location of a leak can be visually identified more easily if the water contains a colorant. Strength is usually tested by measuring permanent deformation of the container. Hydrostatic testing is the most common method employed for testing pipes and pressure vessels. Using this test helps maintain safety standards and durability of a vessel over time. Newly manufactured pieces are initially qualified using the hydrostatic test. They are then re-qualified at regular intervals using the "proof pressure test" which is also called the "modified hydrostatic test". Testing of pressure vessels for transport and storage of gases is very important because such containers can explode if they fail under pressure.', 'title': 'Hydrostatic test'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'A blocked rotor test is conducted on an induction motor. It is also known as short circuit test, locked rotor test or stalled torque test. From this test, short circuit current at normal voltage, power factor on short circuit, total leakage reactance, and starting torque of the motor can be found. The test is conducted at low voltage because if the applied voltage was normal voltage then the current through the stator windings would be high enough to overheat the windings and damage them. The "blocked rotor torque test" is not performed on wound-rotor motors because the starting torque can be varied as desired. However, a "blocked rotor current test" is conducted on squirrel cage rotor motors.', 'title': 'Blocked rotor test'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Water Resistant is a common mark stamped on the back of wrist watches to indicate how well a watch is sealed against the ingress of water. It is usually accompanied by an indication of the static test pressure that a sample of newly manufactured watches were exposed to in a leakage test. The test pressure can be indicated either directly in units of pressure such as bar, atmospheres, or (more commonly) as an equivalent water depth in metres (in the United States sometimes also in feet).', 'title': 'Water Resistant mark'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The wet leakage current test is an electrical withstanding test carried out on electrical appliances to test the electrical isolation of the housing. The test is carried out by submersing the appliance into water with one lead attached to the electrical leads of the appliance, and the other lead connected to the water. It is often carried out on photovoltaic modules in order to qualify them for IEC61646 or IEC61625 certification.', 'title': 'Wet leakage current test'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'G-Shock is a line of watches manufactured by Casio, designed to resist mechanical shock and vibration. Its full form is Gravitational Shock. They are designed primarily for sports, military and outdoors-oriented activities; nearly all G-Shocks are digital or a combination of analog or digital and have a stopwatch feature, countdown timer, backlight and water resistance.', 'title': 'G-Shock'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Anderson–Darling test is a statistical test of whether a given sample of data is drawn from a given probability distribution. In its basic form, the test assumes that there are no parameters to be estimated in the distribution being tested, in which case the test and its set of critical values is distribution-free. However, the test is most often used in contexts where a family of distributions is being tested, in which case the parameters of that family need to be estimated and account must be taken of this in adjusting either the test-statistic or its critical values. When applied to testing whether a normal distribution adequately describes a set of data, it is one of the most powerful statistical tools for detecting most departures from normality.', 'title': 'Anderson–Darling test'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Frogman is a high-end model of the Casio G-Shock line of watches. It was one of the first models of the "Master of G" line, a line of G-Shock watches designed for special uses. The Frogman has an asymmetric shape and is attached eccentrically on its straps. It is specially made as a diving watch for scuba divers and is the only ISO 6425-compliant G-Shock line with a 200 m Divers rating.', 'title': 'Casio G-Shock Frogman'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Electrical safety testing is essential to ensure safe operating standards for any product that uses electricity. Various governments and agencies have developed stringent requirements for electrical products that are sold world-wide. In most markets it is mandatory for a product to conform to safety standards promulgated by safety and standard agencies such as UL, CE, VDE, CSA, BSI, CCC and so on. To conform to such standards, the product must pass safety tests such as the high voltage test (also called as Dielectric voltage-withstand test or high potential test), Insulation Resistance Test, Ground (Earth) Bond & Ground Continuity Test & Leakage Current Test (also called as Line Leakage Test, Earth Leakage Current Test, Enclosure Leakage Current Test or Patient Leakage Current Test). These tests are described in IEC 60335, IEC 61010 and many other national and international standards.', 'title': 'Electrical safety testing'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Test compression is a technique used to reduce the time and cost of testing integrated circuits. The first ICs were tested with test vectors created by hand. It proved very difficult to get good coverage of potential faults, so Design for testability (DFT) based on scan and automatic test pattern generation (ATPG) were developed to explicitly test each gate and path in a design. These techniques were very successful at creating high-quality vectors for manufacturing test, with excellent test coverage. However, as chips got bigger the ratio of logic to be tested per pin increased dramatically, and the volume of scan test data started causing a significant increase in test time, and required tester memory. This raised the cost of testing.', 'title': 'Test compression'}]

