 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Kris Cinkovich (born September 30, 1960) is an American football coach and former player. He is currently the assistant head coach, offensive coordinator and offensive line coach at the University of Idaho, a position he has held since March 2013. Cinkovich has previously been the wide receivers coach for the Arkansas Razorbacks football team at the University of Arkansas from 2010 to 2012. He was also employed at the University of Nevada, Las Vegas, as the wide receivers coach for UNLV Rebels football, and won the Nevada State Championships in 2001 as the head football coach at Las Vegas High School in Las Vegas, Nevada. He and his wife, Joan, have two daughters, Carly and Stephanie.', 'title': 'Kris Cinkovich'}
