 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Brooklyn Nets are an American professional basketball team based in Brooklyn, New York. They are a member of the Atlantic Division of the Eastern Conference in the National Basketball Association (NBA). The team plays its home games at the Barclays Center. The franchise was founded as the New Jersey Americans in 1967, and was one of the eleven original American Basketball Association (ABA) teams. In its second ABA season, Arthur Brown, the team owner, moved the team to Long Island and renamed it the New York Nets. The team won ABA championships in 1974 and 1976. When the ABA merged with the NBA in 1976, the Nets were one of four ABA teams admitted into the NBA. The team was moved to the Rutgers Athletic Center in New Jersey; after the 1976–77 NBA season, the team was renamed the New Jersey Nets. Since they joined the NBA, the Nets have won 4\xa0divisional championships, 2\xa0conference championships and appeared in the playoffs 16\xa0times. The Nets moved to Brooklyn in 2012, and now play as the Brooklyn Nets.', 'title': 'List of Brooklyn Nets head coaches'}
