 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'This is a list of seasons completed by the Brooklyn Nets professional basketball franchise. The Nets were founded as the New Jersey Americans in 1967, a charter franchise of the American Basketball Association (ABA). A year later, the team moved to Long Island, New York, and were renamed as the New York Nets. There, behind the play of Hall of Famer Julius Erving, the team won its only two ABA championships: in 1974 and 1976. After the 1975–76 season, the ABA merged with the National Basketball Association (NBA), and the Nets were one of four franchises who joined the older league. After a season of being the second team to represent the state of New York, (along with the New York Knicks), the team moved back to New Jersey as the New Jersey Nets.', 'title': 'List of Brooklyn Nets seasons'}
