[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Morita therapy is an ecological, purpose-centered, response-oriented therapy created through case-based research by Shoma Morita, M.D. (1874–1938). Morita developed his theory of consciousness and medically-grounded four-stage progressive therapeutic method with as much rigor as his contemporaries, Sigmund Freud, Alfred Adler, Anna Freud, Carl Jung, Jacques Lacan, Melanie Klein, and Wilfred Bion.', 'title': 'Morita therapy'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Polly Young-Eisendrath (born 1947) is a psychologist, feminist, author, teacher, speaker, Jungian analyst, Zen Buddhist, and the founder of Enlightening Conversations: Buddhism and Psychoanalysis Meeting in Person. She has been a featured speaker at the Aspen Ideas Festival, TED-X, and is the recipient of the Otto Weininger Award for Lifetime Achievement in Psychoanalysis. Polly Young-Eisendrath is the originator of Dialogue Therapy -- designed to help couples and others transform chronic conflict into greater closeness and development. In 1983, Polly and her late husband, Ed Epstein, designed Dialogue Therapy as a new form of couples therapy that combined psychoanalysis, Jungian theory, psychodrama, and gender theory. Polly published two books on Dialogue Therapy (1984 and 1993), detailing its theory and methods for clinicians and the general public. She has now re-visioned and updated Dialogue Therapy to include the unique combination of psychodrama, Object Relations, and Mindfulness. In 2018, Shambhala Publications will release "True Love Ways: Relationship as Psycho-Spiritual Development" that offers her vision of personal love as a spiritual path and draws on her experience of 30 years as a Dialogue Therapist and Jungian psychoanalyst. Polly maintains a clinical practice of Jungian psychoanalytic psychotherapy and psychoanalysis in Vermont, U.S.A.', 'title': 'Polly Young-Eisendrath'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'William Ronald Dodds Fairbairn ( ) FRSE (11 August 1889 – 31 December 1964) was a Scottish psychiatrist, psychoanalyst and a central figure in the development of the object relations theory of psychoanalysis.', 'title': 'Ronald Fairbairn'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Schema therapy was developed by Jeffrey E. Young for use in treatment of personality disorders and chronic DSM Axis I disorders, such as when patients fail to respond or relapse after having been through other therapies (for example, traditional cognitive behavioral therapy). Schema therapy is an integrative psychotherapy combining theory and techniques from previously existing therapies, including cognitive behavioral therapy, psychoanalytic object relations theory, attachment theory, and Gestalt therapy.', 'title': 'Schema therapy'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Melanie Reizes Klein (30 March 1882 – 22 September 1960) was an Austrian-British psychoanalyst who devised novel therapeutic techniques for children that influenced child psychology and contemporary psychoanalysis. She was a leading innovator in object relations theory.', 'title': 'Melanie Klein'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Donald Woods Winnicott ( ; 7 April 1896 25 January 1971) was an English paediatrician and psychoanalyst who was especially influential in the field of object relations theory. He was a leading member of the British Independent Group of the British Psychoanalytical Society, President of the British Psychoanalytical Society twice (1956–1959 and 1965–1968), and a close associate of Marion Milner. He is best known for his ideas on the true self and false self, and the transitional object. He wrote several books, including "Playing and Reality", and over 200 papers.', 'title': 'Donald Winnicott'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'A love object is an object of love; see Love and Object relations theory.', 'title': 'Love object'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Object relations theory in psychoanalytic psychology is the process of developing a psyche in relation to others in the environment during childhood. Based on psychodynamic theory, the object relations theory suggests that the way people relate to others and situations in their adult lives is shaped by family experiences during infancy. For example, an adult who experienced neglect or abuse in infancy would expect similar behavior from others who remind them of the neglectful or abusive parent from their past. These images of people and events turn into "objects" in the unconscious that the "self" carries into adulthood, and they are used by the unconscious to predict people\'s behavior in their social relationships and interactions.', 'title': 'Object relations theory'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Otto Friedmann Kernberg (born 10 September 1928) is a psychoanalyst and professor of psychiatry at Weill Cornell Medical College. He is most widely known for his psychoanalytic theories on borderline personality organization and narcissistic pathology. In addition, his work has been central in integrating postwar ego psychology (which was primarily developed in the United States and the United Kingdom) with Kleinian and other object relations perspectives (which was developed primarily in the United Kingdom and South America). His integrative writings were central to the development of modern object relations, a theory of mind that is perhaps the theory most widely accepted among modern psychoanalysts.', 'title': 'Otto F. Kernberg'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Margaret I. Little (21 May 1901 – 27 November 1994) was a British psychoanalyst of the British Middle Group, and an influential figure in the creation of object relations theory, particularly as an early proponent of the utility of countertransference in the analytic process.', 'title': 'Margaret Little'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'JK Tyre & Industries Ltd is an Automotive Tyre, Tubes and flaps manufacturing company based in Delhi, India. The name JK is derived from the initials of Kamlapatji (1884–1937) and his father Seth Juggilal (1857–1922). The company is the market leader in Truck/Bus Radial tire in India and is the only tyre manufacturer offering the entire range of 4 wheeler radials for Trucks, Buses and Cars. JK Tyre has a worldwide customer base in over 80 countries across all 6 continents. It is a part of J. K. Organisation group of Companies. JK Tyre acquired Mexican tyre major – Tornel in 2008. With production facilities in all 9 plants, total production capacity is almost 20 million tyres p.a.', 'title': 'JK Tyre'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Stomil Olsztyn was a tyre manufacturer based in Olsztyn, Poland. The company came into existence when the tyre plant OZOS „Stomil”, founded in 1967, was privatized in 1992. In 1995 Michelin acquired the majority share in Stomil. From 1995 to May 28, 2004 Stomil was quoted at the Warsaw Stock Exchange. In 2005 Michelin gained full control of Stomil and renamed it to "Michelin Polska S.A.". With roughly 4,000 employees "Michelin Polska" is one of the largest Michelin plants and the largest tyre plant in Poland.', 'title': 'Stomil Olsztyn (company)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Belshina is a tyre manufacturer in Belarus. The name is an abbreviation for "Belаruskaya shina", or "Belarusian Tyre".', 'title': 'Belshina'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The 1978 Brazilian Grand Prix was a Formula One motor race held on 29 January 1978 at Jacarepagua. The race was won by Argentine driver Carlos Reutemann driving a Ferrari 312T2 in a flag-to-flag performance. The win also represented the first win for tyre manufacturer Michelin. Local driver Emerson Fittipaldi was second, scoring the first podium finish for the Fittipaldi Automotive with Austrian Brabham driver Niki Lauda finishing third. French driver Didier Pironi took his first points in Formula One, finishing sixth. The race also represented the first win for French tyre manufacturer Michelin in Formula One.', 'title': '1978 Brazilian Grand Prix'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Continental AG, commonly known as Continental, is a leading German automotive manufacturing company specialising in tyres, brake systems, interior electronics, automotive safety, powertrain and chassis components, tachographs, and other parts for the automotive and transportation industries. Continental is based in Hanover, Lower Saxony, Germany. Continental is the world\'s fourth-largest tyre manufacturer. Continental was founded in 1871 as a rubber manufacturer, "Continental-Caoutchouc und Gutta-Percha Compagnie". After acquiring Siemens AG\'s VDO automotive unit in 2007 Continental was ranked third in global OEM automotive parts sales in 2012 according to a study sponsored by PricewaterhouseCoopers.', 'title': 'Continental AG'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Neeraj Kanwar (born 6 September 1971) is the vice chairman and managing director of Apollo Tyres, India's second largest tyre manufacturer with annual revenues of over $2 billion. He is credited with turning Apollo Tyres from a commercial vehicle-focussed tyre manufacturer in India when he joined in 1995 into a multinational company that now manufactures tyres for commercial and passenger vehicles as well as two wheeler tyres.", 'title': 'Neeraj Kanwar'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Jürgen M. Geissinger (born July 24, 1959) is a German technology business executive and Chief Executive Officer of "Senvion S.A.", a Hamburg based wind turbine manufacturer. Geissinger is best known for his role as the Chief Executive of Schaeffler Technologies AG & Co. KG, a technology conglomerate known for its bearing solutions and precision components for engine and transmission systems for automotive, as well as industrial and aerospace applications. During Geissinger’s tenure as CEO, annual sales have risen more than fivefold. Schaeffler AG, employing over 76,000 people across 180 locations in 50 countries, with annual sales of $14 billion, is also the controlling shareholder of Continental AG with 49.9% of its shares.', 'title': 'Juergen M. Geissinger'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Lapo Edovard Elkann (born 7 October 1977) is an Italian entrepreneur and grandson of Gianni Agnelli, the former controlling CEO and controlling shareholder of Fiat Automobiles.', 'title': 'Lapo Elkann'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'TerreStar Corporation ("TSTR"), formerly "Motient Corp." (MNCP - 2000-2007) and "American Mobile Satellite Corp." (AMSC - 1988-2000), was the controlling shareholder of "TerreStar Networks Inc.", "TerreStar National Services, Inc." and "TerreStar Global Ltd.", and a shareholder of SkyTerra Communications.', 'title': 'TerreStar Corporation'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Clément Tyres, Clément Pneumatics, Clément Pneumatici, is a Franco Italian tyre manufacturer that was founded by French industrialist and bicycle manufacturer Adolphe Clément-Bayard, possibly around the 1900s. The brand ceased active trading in the 1990s but was revived under American identity in 2010.', 'title': 'Clément Tyres'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Florida (Spanish for "land of flowers") is a state in the southeastern region of the United States. It is bordered to the west by the Gulf of Mexico and Alabama, to the north by Alabama and Georgia, to the east by the Atlantic Ocean, and to the south by the Straits of Florida. Florida is the 22nd-most extensive, the 3rd-most populous, and the 8th-most densely populated of the U.S. states. Jacksonville is the most populous municipality in the state, and is legally the largest city by area in the contiguous United States (due to the consolidation of Jacksonville with Duval County). The Miami metropolitan area is Florida\'s most populous urban area. The city of Tallahassee is the state capital.', 'title': 'Florida'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Alabama Theatre is a movie palace in Birmingham, Alabama. It was built in 1927 by Paramount's Publix Theatre chain as its flagship theater for the southeastern region of the United States. Seating 2,500 people at the time, it was the largest in the Birmingham Theatre district. The district was once home to a myriad of large theaters that featured vaudeville, performing arts, nickelodeons, and large first-run movie palaces. The Alabama is the only district theater still operating today. Built to show silent films, the Alabama still features its original Wurlitzer theater organ. Other than the Alabama, the Lyric Theatre is the only theater still standing in the district.", 'title': 'Alabama Theatre'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Interstate 71 (I-71) is a north-south (physically northeast-southwest) Interstate Highway in the Great Lakes/Midwestern and Southeastern region of the United States. Its southern terminus is at an interchange with Interstate 64 and Interstate 65 (the Kennedy Interchange) in Louisville, Kentucky. Its northern terminus is at an interchange with Interstate 90 in Cleveland, Ohio. I-71 runs concurrently with Interstate 75 from a point about 20 mi south of Cincinnati, Ohio into downtown Cincinnati. Almost three quarters of the route lies east of I-75, thereby putting it out of its proper place in the Interstate grid.', 'title': 'Interstate 71'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Charlotte metropolitan area (also Metrolina, Charlotte Metro, or Charlotte USA) is a metropolitan area/region of North and South Carolina within and surrounding the city of Charlotte. Located in the Piedmont of the Southeastern United States, the Charlotte metropolitan area is well known for its auto racing history (especially NASCAR). The region is headquarters to 8 Fortune 500 and 7 Fortune 1000 companies including Bank of America, Duke Energy, Sealed Air Corporation, Nucor Steel, and Lowe's Home Improvement Stores. Additional headquarters include Harris Teeter, Food Lion, Cheerwine and Sundrop. It is home to one of the world's busiest airports , Charlotte Douglas International Airport, and is also the Carolinas' largest manufacturing region. The Charlotte MSA is the largest in the Carolinas, and the fourth largest metropolitan area in the Southeastern region of the United States behind, Miami, Atlanta, and Tampa.", 'title': 'Charlotte metropolitan area'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': "Arkansas (pronounced ) is a state in the southeastern region of the United States, home to over 3 million people as of 2017. Its name is of Siouan derivation from the language of the Osage denoting their related kin, the Quapaw Indians. The state's diverse geography ranges from the mountainous regions of the Ozark and the Ouachita Mountains, which make up the U.S. Interior Highlands, to the densely forested land in the south known as the Arkansas Timberlands, to the eastern lowlands along the Mississippi River and the Arkansas Delta.", 'title': 'Arkansas'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Downtown Bentonville is the historic business district of Bentonville, Arkansas. The region is the location of Walmart Home Office; city and county government facilities; and most of Bentonville's tourist attractions for the city and contains many historically and architecturally significant properties. Downtown measures approximately 1.5 sqmi and is defined as the region between Tiger Boulevard to the north, Highway\xa0102 (AR\xa0102) to the south, Walton Boulevard (U.S. Route 71B) to the west and J Street to the east. Similar to other central business districts in the US, Downtown has recently undergone a transformation that included the construction of new condos and lofts, renovation of historic buildings, and arrival of new residents and businesses. Upon opening of Crystal Bridges Museum of American Art the increased tourist traffic related to the museum has made Downtown Bentonville one of the state's most popular tourism destinations.", 'title': 'Downtown Bentonville'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Coffeyville is a city in southeastern Montgomery County, Kansas, United States, located along the Verdigris River in the state's southeastern region. As of the 2010 census, the city population was 10,295. It is the most populous city of Montgomery County and with its southeast Kansas location is located in the Tulsa, Oklahoma media market. The town of South Coffeyville, Oklahoma is located approximately 1 mile south of the city, existing as a separate political entity immediately south of the state line.", 'title': 'Coffeyville, Kansas'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Hartsfield–Jackson Atlanta International Airport (IATA: ATL,\xa0ICAO: KATL,\xa0FAA LID: ATL) , also known as Atlanta Airport, Hartsfield, or Hartsfield–Jackson, is an international airport located 7 mi south of Atlanta's central business district, in the U.S. state of Georgia. It has been the world's busiest airport by passenger traffic since 1998; and by number of landings and take-offs from 2005 to 2013, losing that title to Chicago-O'Hare in 2014, but regaining it a year later. Hartsfield–Jackson held its ranking as the world's busiest airport in 2012, both in passengers and number of flights, by accommodating 100 million passengers (more than 260,000 passengers daily) and 950,119 flights. Many of the nearly one million flights are domestic flights from within the United States, where the airport serves as a major hub for travel throughout the southeastern region of the country. The airport has 207 domestic and international gates. ATL covers 4,700 acres (1,902 ha) of land.", 'title': 'Hartsfield–Jackson Atlanta International Airport'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Uruguay ( ; ] ), officially the Oriental Republic of Uruguay (Spanish: "República Oriental del Uruguay" ), is a sovereign state in the southeastern region of South America. It borders Argentina to its west and Brazil to its north and east, with the Río de la Plata (River of Silver) to the south and the Atlantic Ocean to the southeast. Uruguay is home to an estimated /1e6 round 2 million people, of whom 1.8 million live in the metropolitan area of its capital and largest city, Montevideo. With an area of approximately 176000 km2 , Uruguay is geographically the second-smallest nation in South America, after Suriname.', 'title': 'Uruguay'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Tennessee ( ; Cherokee: ᏔᎾᏏ , "Tanasi " ) is a state located in the southeastern region of the United States. Tennessee is the 36th largest and the 16th most populous of the 50 United States. Tennessee is bordered by Kentucky and Virginia to the north, North Carolina to the east, Georgia, Alabama, and Mississippi to the south, and Arkansas and Missouri to the west. The Appalachian Mountains dominate the eastern part of the state, and the Mississippi River forms the state\'s western border. Nashville is the state\'s capital and largest city, with a population of 660,388. Tennessee\'s second largest city is Memphis, which has a population of 652,717.', 'title': 'Tennessee'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The KOLIN are a Hungarian indie-pop band best known for their hit song "San Francisco". The band was formed in 2007 in Budapest. Their music style is synthpop influenced with indie rock and new rave sounds. The band consists of Márkó Linczényi (vocals/synthesizer), Ágoston Iván (drums) and Ferigeri (bass). Their debut album called "Yell Into The Kazzo". It was released in 2008 by Universal Music Group. The KOLIN won the award for Best Hungarian Act at the 2009 and 2010 MTV Europe Music Awards.', 'title': 'The KOLIN'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Iron Butterfly is an American rock band best known for the 1968 hit "In-A-Gadda-Da-Vida", providing a dramatic sound that led the way towards the development of hard rock and heavy metal music. Formed in San Diego, California, among band members who used to be "arch enemies", their heyday was the late 1960s, but the band has been reincarnated with various members with varying levels of success, with no new recordings since 1975. The band\'s seminal 1968 album "In-A-Gadda-Da-Vida" is among the world\'s 40 best-selling albums, selling more than 30 million copies. Iron Butterfly is also notable for being the first group to receive an RIAA platinum award.', 'title': 'Iron Butterfly'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Lynyrd Skynyrd (pronounced ) is an American rock band best known for popularizing the Southern rock genre during the 1970s. Originally formed in 1964 as "My Backyard" in Jacksonville, Florida, the band was also known by names such as "The Noble Five" and "One Percent", before finally deciding on "Lynyrd Skynyrd" in 1969. The band gained worldwide recognition for its live performances and signature songs "Sweet Home Alabama" and "Free Bird". At the peak of their success, two band members and a backup singer died in an airplane crash in 1977, putting an abrupt end to the band\'s most popular incarnation. The band has sold 28 million records in the United States.', 'title': 'Lynyrd Skynyrd'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Lit is an American rock band, formed in 1995 in Fullerton, California. They are best known for their hit song "My Own Worst Enemy".', 'title': 'Lit (band)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Starfires is an American rock and roll band, founded in Cleveland, Ohio in 1958, by Tom King when he was aged 15. The band is sometimes identified as Tom King and the Starfires. King is best known as the original bandleader of the Outsiders; however, it was only at the insistence of Capitol Records that the band\'s name was changed when they created their breakout hit "Time Won\'t Let Me". (This is not the same band as the Starfires, a 1960s Los Angeles garage rock band best known for their track, "I Never Loved Her".)', 'title': 'The Starfires (Cleveland band)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Seven and the Sun was an American rock band best known for their 2002 single "Walk with Me". Their song was used in the TV soap opera "Passions" and was also featured in the Columbia Pictures film, "America\'s Sweethearts" starring Julia Roberts, Billy Crystal, John Cusack and Catherine Zeta-Jones. It received moderate air play on American radio, reaching number 38 on the "Billboard" Adult Top 40, number 27 on the "Billboard" Mainstream Top 40 and number 40 on the "Billboard" Top 40 Tracks chart. "Walk with Me" was their only hit.', 'title': 'Seven and the Sun'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "The View from the Bottom is the fifth studio album by the American rock band Lit, released on June 19, 2012 through Megaforce Records. It is the band's first new album in eight years, since the release of their self-titled album in 2004. It also marks the first album with Nathan Walker on drums, succeeding the late Allen Shellenberger, who died in 2009, and rhythm guitarist Ryan Gillmor, making it the only time the band has recorded as a five-piece.", 'title': 'The View from the Bottom'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Finger Eleven is a Canadian rock band from Burlington, Ontario, formed in 1990. They have released seven total studio albums (six as Finger Eleven and one as Rainbow Butt Monkeys), with their album "The Greyest of Blue Skies" bringing them into the mainstream. The 2003 self-titled album achieved Gold status in the United States and Platinum in Canada, largely from the success of the single "One Thing", which marked the band\'s first placing on the US Hot 100 Chart at number 16. Their 2007 album, "Them vs. You vs. Me", launched the single "Paralyzer", which went on to top numerous charts including the Canadian Hot 100 and both US rock charts, as well as reaching No.\xa06 on the US Hot 100 and No.\xa012 on the Australian Singles Chart. They won the Juno Award for Rock Album of the Year in 2008. It was later certified gold status in the US and multi platinum in Canada. They released their sixth studio album, "Life Turns Electric", on October 5, 2010; it was nominated for a Juno Award for Best Rock Album of the Year. They released their first single, "Living in a Dream", adding a little bit of more of funk rock and dance rock, just like their hit song "Paralyzer". " Five Crooked Lines", their 7th studio album, was released July 31, 2015, with "Wolves and Doors" as the lead single.', 'title': 'Finger Eleven'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Coming Home is the fifth studio album by American rock band New Found Glory. It was produced by the band along with Thom Panunzio and released on September 19, 2006 through Geffen Records. Written and demoed at the Morning View Mansion in Malibu, California during 2005, "Coming Home" is a concept album unified by a lyrical theme of being away from home and loved ones. The album marks a departure from the band\'s earlier work, implementing a more layered and mid-tempo sound that features various piano, keyboard, and string instrumentation more comparable to classic rock than their usual pop punk style.', 'title': 'Coming Home (New Found Glory album)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Classic Crime is an American rock band from Seattle, Washington formed in 2004. The band\'s current lineup consists of Matt MacDonald (vocals, guitar), Alan Clark (bass), Robert "Cheeze" Negrin (guitar), and Paul "Skip" Erickson (drums, vocals). They have released three albums and an EP on Tooth & Nail Records, two of which, "The Silver Cord" (2008) and "Vagabonds" (2010), charted in the "Billboard" 200. In July 2011, the band left Tooth & Nail to produce a fourth album with the help of fan donations via Kickstarter, called "Phoenix" (2012). In April 2016, The Classic Crime created a Kickstarter to raise funds for a fifth studio album. Within three hours they acquired the necessary $30,000 for the album. On April 28th, 2017 they released their fifth studio album titled "How to Be Human"(2017).', 'title': 'The Classic Crime'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Raids on Lochaber and Shiramore took place in the Scottish Highlands between 22 May and 31 August 1746 and were part of the closing operations of the British-Hanoverian Government to bring to an end the Jacobite rising of 1745. Sometimes referred to as the "mopping up" operations many rebels surrendered themselves and their arms, while others were captured and punished. It also included the hunt for the Jacobite leader "Bonnie Prince" Charles Edward Stuart otherwise known as the "Young Pretender". Most of the work was done on behalf of the Government by the Independent Highland Companies of militia and also the Campbell of Argyll Militia.', 'title': 'Raids on Lochaber and Shiramore'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Dauphine of France (] ) was the wife of the Dauphin of France (the heir apparent to the French throne). The position was analogous to the Princess of Wales (the wife of the heir apparent to the British throne).', 'title': 'Dauphine of France'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Prince Christian of Hanover (Christian Heinrich Clemens Paul Frank Peter Welf Wilhelm-Ernst Friedrich Franz Prince of Hanover, Duke of Brunswick and Lüneburg; born 1 June 1985) is the younger son of Ernst August, Prince of Hanover, and his first wife Chantal Hochuli. He is the second in the line of succession to the former Hanoverian throne, after his elder brother Prince Ernst August. As a descendant of George III of the United Kingdom, Christian is also in the line of succession to the British throne.', 'title': 'Prince Christian of Hanover (born 1985)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Count Ingolf of Rosenborg {\'1\': ", \'2\': ", \'3\': \'RE\', \'4\': "} (born 17 February 1940) is a former Danish prince. Born Prince Ingolf of Denmark (Danish: "Prins Ingolf Christian Frederik Knud Harald Gorm Gustav Viggo Valdemar Aage til Danmark" ), he appeared likely to some day become king until the constitution was changed in 1953 to allow females to inherit the crown, placing his branch of the dynasty behind that of his cousin Princess Margrethe and her two younger sisters. He later gave up his princely rank and his rights to the throne in order to marry a commoner. However, through his mother, he is a legitimate descendant of King George II of Great Britain, and retains a place in line to the British throne.', 'title': 'Count Ingolf of Rosenborg'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Reprisal operations (Hebrew: פעולות התגמול\u200e , "Pe\'ulot HaTagmul ") were raids carried out by the Israel Defense Forces in the 1950s and 1960s in response to frequent fedayeen attacks during which armed Arab militants infiltrated Israel from Syria, Egypt and Jordan to carry out attacks on Israeli civilians and soldiers. Most of Reprisal operations followed raids that resulted in Israeli fatalities. The goal of these operations was to create deterrence and prevent future attacks. Two other factors behind the raids were restoring public morale and training newly formed army units.', 'title': 'Reprisal operations'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Karl-Konstantin von Habsburg (Given names: Karl-Konstantin Michael Stephan Maria; born on 20 July 2004 in Budapest) referred to in Austria as Karl-Konstantin Habsburg-Lothringen, in Hungary as Habsburg Károly Konstantin, and also as Archduke Karl-Konstantin of Austria, is the only son of Georg von Habsburg and Duchess Eilika of Oldenburg. s of 2016 , he is considered third in line of succession to the former Austro-Hungarian throne. He is the great-grandson of Emperor Charles I of Austria through his grandfather Otto von Habsburg. Through his maternal grandfather, he is a descendant of George II of Great Britain, and would therefore be in line for the British throne were he not a Catholic and barred by the Act of Settlement.', 'title': 'Karl-Konstantin von Habsburg'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The Jacobite rising of 1745 (Scottish Gaelic: "Bliadhna Theàrlaich" ] , "The Year of Charles") was the attempt by Charles Edward Stuart to regain the British throne for the exiled House of Stuart. The rising occurred during the War of the Austrian Succession, when most of the British Army was on the European continent. Charles Edward Stuart, commonly known as "Bonnie Prince Charlie" or "the Young Pretender", sailed to Scotland and raised the Jacobite standard at Glenfinnan in the Scottish Highlands, where he was supported by a gathering of Highland clansmen. The march south began with an initial victory at Prestonpans near Edinburgh. The Jacobite army, now in bold spirits, marched onwards to Carlisle, over the border in England. When it reached Derby, some British divisions were recalled from the Continent and the Jacobite army retreated north to Inverness where the last battle on Scottish soil took place on a nearby moor at Culloden. The Battle of Culloden ended with the final defeat of the Jacobite cause. Charles Edward Stuart fled with a price on his head before finally sailing to France.', 'title': 'Jacobite rising of 1745'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'In English history, Act of Settlement most commonly refers to the Act of Settlement 1701, governing the line of succession to the English throne and, after 1707, to the British throne.', 'title': 'Act of Settlement (disambiguation)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Succession to the Crown Act 2013 (c. 20) is an Act of the Parliament of the United Kingdom. It altered the laws of succession to the British throne in accordance with the 2011 Perth Agreement. The act replaced male-preference primogeniture with absolute primogeniture for those born in the line of succession after 28 October 2011, which meant the eldest child regardless of gender would precede his or her siblings. The act also ended the disqualification of a person who married a Roman Catholic from the line of succession, and removed the requirement of those outside the first six persons in line to the throne to seek the Sovereign's approval to marry. It was brought into force on 26 March 2015, at the same time as the other Commonwealth realms implemented the Perth Agreement in their own laws.", 'title': 'Succession to the Crown Act 2013'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Kashyapa I, also known as Kasyapa I, was a king of Sri Lanka, who ruled the country from 473 to 495 CE. He was the second king of the royal Mauryan dynasty of Sri Lanka. Kashyapa is credited with the construction of the Sigiriya citadel and the surrounding city. He acquired the throne by overthrowing his father, King Dhatusena, and usurping his brother and rightful heir to the throne, Moggallana, in a palace coup. He imprisoned and later executed his father. Kashyapa was also known as "Pithru Ghathaka Kashyapa" (Kashyapa the Patricide), after this incident. He was later defeated by Moggallana, who had fled to South India and returned with an army to regain the throne. Kashyapa was killed in the battle that ensued.', 'title': 'Kashyapa I of Anuradhapura'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Lois Erdmann Wright is an American artist, author, and local television personality. She is best known for her appearance in the 1975 independent documentary film "Grey Gardens" by Albert and David Maysles. She is the author of the memoir "My Life at Grey Gardens: 13 Months and Beyond". She currently hosts "The Lois Wright Show" for LTV Public Access in East Hampton. As an artist, she has exhibited at Guild Hall in East Hampton and at the National Arts Club in New York. Her art focuses mainly on Edith Bouvier Beale and Edith Ewing Bouvier Beale of Grey Gardens.', 'title': 'Lois Wright'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Phelan Beale (May 23, 1881 – June 12, 1956) was an American attorney and sportsman in New York City who was married to Edith Ewing Bouvier, an aunt of Jacqueline Kennedy Onassis. Beale is probably best remembered as the absent father chronicled in the Grey Gardens saga portrayed in a 1975 movie documentary, 2006 Broadway musical, and 2009 HBO Film, all of which were named for his home in East Hampton, New York.', 'title': 'Phelan Beale'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Grey Gardens is a 1975 American documentary film by Albert and David Maysles. The film depicts the everyday lives of two reclusive, formerly upper class women, a mother and daughter both named Edith Beale, who lived in poverty at Grey Gardens, a derelict mansion at 3 West End Road in the wealthy Georgica Pond neighborhood of East Hampton, New York. The film was screened at the 1976 Cannes Film Festival but was not entered into the main competition.', 'title': 'Grey Gardens'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Grey Gardens is an HBO film about the lives of Edith Bouvier Beale/"Little Edie", played by Drew Barrymore, and her mother Edith Ewing Bouvier/"Big Edie", played by Jessica Lange. Co-stars include Jeanne Tripplehorn as Jacqueline Kennedy (Little Edie\'s cousin) and Ken Howard as Phelan Beale (Little Edie\'s father). The film, directed by Michael Sucsy and co-written by Sucsy and Patricia Rozema, flashes back and forth between various events and dates ranging from Little Edie as a young débutante in 1936 moving with her mother to their Grey Gardens estate through the filming and premiere of the actual 1975 documentary "Grey Gardens".', 'title': 'Grey Gardens (2009 film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Grey Gardens is a musical with book by Doug Wright, music by Scott Frankel, and lyrics by Michael Korie, based on the 1975 documentary of the same title about the lives of Edith Ewing Bouvier Beale ("Big Edie") and her daughter Edith Bouvier Beale ("Little Edie") by Albert and David Maysles. The Beales were Jacqueline Kennedy\'s aunt and cousin, respectively. Set at Grey Gardens, the Bouviers\' mansion in East Hampton, New York, the musical tracks the progression of the two women\'s lives from their original status as rich and socially polished aristocrats to their eventual largely isolated existence in a home overrun by cats and cited for repeated health code violations. However, its more central purpose is to untangle the complicated dynamics of their dysfunctional mother/daughter relationship.', 'title': 'Grey Gardens (musical)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Michael Korie is an American librettist and lyricist whose writing for musical theater and opera includes the musicals "Grey Gardens" and "Far From Heaven", and the operas "Harvey Milk" and "The Grapes of Wrath". His works have been produced on Broadway, Off-Broadway, and internationally. His lyrics have been nominated for the Tony Award and the Drama Desk Award, and won the Outer Critics Circle Award. In 2016, Korie was awarded the Marc Blitzstein Award from the American Academy of Arts and Letters.', 'title': 'Michael Korie'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Grey Gardens is a 28-room house at 3 West End Road and Lily Pond Lane in the Georgica Pond neighborhood of East Hampton, New York. The lives of its residents were chronicled in the "Grey Gardens" 1975 documentary, 2006 Broadway musical, 2009 television movie, and numerous other books and documentaries.', 'title': 'Grey Gardens (estate)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Jeanne Marie Tripplehorn (born June 10, 1963) is an American film and television actress. Her film career began with the role of a police psychologist in the erotic thriller "Basic Instinct" (1992). Her other film roles include "The Firm" (1993), "Waterworld" (1995) and "Sliding Doors" (1998). On television, she starred as Barbara Henrickson on the HBO drama series "Big Love" (2006–11) and as Dr. Alex Blake on the CBS police drama "Criminal Minds" (2012–14), and she received a Primetime Emmy Award nomination for her performance as Jacqueline Kennedy Onassis in the 2009 HBO movie "Grey Gardens".', 'title': 'Jeanne Tripplehorn'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Malcolm Gets (born December 28, 1964) is an American actor. He is best known for his role as Richard in the American television sitcom "Caroline in the City". Gets is also a dancer, singer, composer, classically trained pianist, vocal director, and choreographer. He played Gould in the 2009 film "Grey Gardens" opposite Jessica Lange and Drew Barrymore and his first solo album came out in 2009 from PS Classics.', 'title': 'Malcolm Gets'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Jerry “The Marble Faun” Torre (b. 1953? /1955) is an American sculptor. He is best known for his appearance in the 1975 independent documentary films "Grey Gardens" and "The Beales of Grey Gardens" by Albert and David Maysles. As a sculptor, his work has been shown in several galleries in New York City and written about in The New York Times, The Wall Street Journal, Vogue, Architectural Digest, Forbes, among other publications. He is affectionately known among cult-film followers as “The Marble Faun”; a nickname that Edith Bouvier Beale gave him upon their first meeting. Torre worked as an assistant to Wayland Flowers, and through Aristotle Onassis obtained a job tending gardens for the Royal Family of Saudi Arabia. He was portrayed in the Tony Award winning Broadway musical "Grey Gardens" in 2006. His life has been documented in the 2011 film "The Marble Faun of Grey Gardens".', 'title': 'Jerry Torre'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The National Brewing Company was a beer brewing company based in Baltimore, Maryland. The National Brewing Company operated from 1872 until the late 1970s. At the end of the 1970s, the National Brewing Company was purchased and their breweries were shut down. However, National's two most prominent brands, National Bohemian Beer and Colt 45, were kept alive and are now brewed in Wisconsin.", 'title': 'National Brewing Company'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Homebrewing is the brewing of beer on a small scale for personal, non-commercial purposes.', 'title': 'Homebrewing'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Ebling Brewing Company, founded in 1868, was located in the South Bronx (the Melrose neighborhood, at the intersection 156th Street and St. Ann\'s Avenue) when German was the second language to English there. The company advertised their technique of aging their beer in "natural rock caves." These caves were dug into a hill behind its headquarters under the brewery in the Bronx. The Ebling Brewing Company suffered under the laws of Prohibition. In 1925 it was required to padlock its doors for 4 months and pay a $250,000 fine after it was found to have two truckloads of beer that had higher than the legal alcohol content; they were found to be possessing "real beer." The 72-year old president of the company at the time was William Ebling. The company finally closed its doors for good in the 1940s. The Ebling Brewing Company headquarters were razed and a parking lot was created over the site. The caves, sometimes as large as 20\' x 100\', were covered and forgotten by most people.', 'title': 'Ebling Brewing Company'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Shipyard Brewing Company is a brewery and soft drink manufacturer in Portland, Maine, USA, and founded in 1994. Shipyard is the largest brewer in Maine (owning the Shipyard, Sea Dog Brewing Company, and Casco Bay Brewing Company banners, and bottling under contract with Gritty McDuff's Brewing Company). Shipyard is the fourth largest microbrewery in New England after Boston Beer Company, Harpoon Brewery, and Magic Hat Brewing Company.", 'title': 'Shipyard Brewing Company'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Genesee Brewing Company is an American brewery located along the Genesee River in Rochester, New York. In 1878, Genesee Brewing Company moved up into Rochester. From 2000 to 2009, the company was known as the High Falls Brewing Company. In 2009, High Falls was acquired by the capital investment firm KPS Capital. Together with also newly acquired Labatt USA, KPS merged the two companies as North American Breweries. Along with this change, High Falls Brewery changed its name back to the original "Genesee Brewing Company" operating under the North American Breweries name. In October 2012, North American Breweries was purchased by FIFCO', 'title': 'Genesee Brewing Company'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'MillerCoors is a beer brewing company in the United States. In 2002 South African Breweries purchased Miller Brewing Company to create SABMiller. In 2005, Molson Brewery of Canada and Coors Brewing Company merged to form the Molson Coors Brewing Company. Then, in 2008, SABMiller and Molson Coors created MillerCoors as a joint venture for their operations in the U.S. The company is the second-largest brewer in the U.S., after Anheuser-Busch.', 'title': 'MillerCoors'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Pabst Brewing Company ( ) is an American company that dates its origins to a brewing company founded in 1844 by Jacob Best and was, by 1889, named after Frederick Pabst. It is currently the holding company contracting for the brewing of over two dozen brands of beer and malt liquor from now defunct companies including Pabst Blue Ribbon, P. Ballantine and Sons Brewing Company, G. Heileman Brewing Company, Lone Star Brewing Company, Pearl Brewing Company, Piels Bros., Valentin Blatz Brewing Company, National Brewing Company, Olympia Brewing Company, Falstaff Brewing Corporation, Primo Brewing & Malting Company, Rainier Brewing Company, F & M Schaefer Brewing Company, Joseph Schlitz Brewing Company, Jacob Schmidt Brewing Company and Stroh Brewery Company.', 'title': 'Pabst Brewing Company'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Triangle Brewing Co. (TBC) is a microbrewery owned and operated entirely by business partners (and high-school friends) Rick "the Brewer" Tufts and Andy "the Bloke" Miller, who have recently resettled in Durham, North Carolina from Connecticut. Andy Miller had extensive local restaurant management experience, and Rick Tufts apprenticed at Flying Fish Brewing Company and was an avid homebrewer long before founding a new brewery. TBC began selling beer on July 4, 2007 and was the only microbrewery in Durham. The arrival of a microbrewery in Durham is arguably part of the current downtown art, building, and cultural Renaissance.', 'title': 'Triangle Brewing Company'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Hudepohl Brewing Company is a brewery established in Cincinnati, Ohio in 1885 by founder Ludwig Hudepohl II. Hudepohl was the son of Bavarian immigrants and had worked in the surgical tool business before starting his brewery. Hudepohl combined with Schoenling Brewing Company in 1986. Today, the Hudepohl-Schoenling Brewing Company is a wholly owned subsidiary of Christian Moerlein Brewing Co..', 'title': 'Hudepohl Brewing Company'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Gunther Brewing Company is a historic brewery building located at Baltimore, Maryland, United States. The site comprises 15 masonry buildings. The main structure is a five-story brick "L"-shaped Romanesque Revival-style brew house with a two-story brick ice plant built about 1910 and one- and two-story boiler room. Additional brew houses built in 1936 and 1950 are also on the property. The Tulkoff Factory and Warehouse was built about 1964. It was home to the George Gunther, Jr. Brewing Company, founded in 1900. By 1959 it was the second largest brewery in Baltimore, when it produced 800,000 barrels per year and employed approximately 600 people. Hamm\'s Brewing Company bought the Gunther Brewing Company in 1960. Later acquired by the F. & M. Schaefer Brewing Company in 1963, the plant was closed in 1978. The Tulkoff company briefly used the factory for their sauce products at the conclusion of all brewing operations.', 'title': 'Gunther Brewing Company'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Alfredo Guati Rojo National Watercolor Museum (Museo Nacional de Acuarela Alfredo Guati Rojo) was the first museum in the world dedicated specifically to watercolor painting. It is located in the Coyoacán borough of Mexico City, in a former private house which was donated to the museum by the city government. It was founded and run by artist Alfredo Guati Rojo from its beginnings in 1964 until his death in 2003. The museum is dedicated to the preservation and continuance of watercolor painting both in Mexico and abroad, with its permanent collection of 300 works donated by Guati Rojo and his wife, classes in watercolor and drawing, its annual Premio Nacional de Acuarela (National Watercolor Prize) and various temporary exhibits both at the museum and abroad.', 'title': 'Alfredo Guati Rojo National Watercolor Museum'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The General (1964–1998) was a bi-monthly periodical devoted to supporting Avalon Hill\'s line of wargames, with articles on game tactics, history, and industry news. It was the first professionally produced wargaming magazine for the nascent cardboard and hex-map wargaming hobby. Over the years the magazine was variously called "The Avalon Hill General", "Avalon Hill\'s General", "The General Magazine", or simply "General". It was headquartered in Baltimore, Maryland. With the sale of Avalon Hill to Hasbro in 1998 the magazine ceased. Its unofficial heir was "Operations Magazine" published by Multi-Man Publishing to support the line of Avalon Hill games that remained in print, but that too went out of print in 2010, replaced by "Special Ops" magazine in 2011.', 'title': 'The General (magazine)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Maynard and Edith Hamlin Dixon House and Studio is a residence and former painting studio in Mount Carmel, Utah. Maynard Dixon was a prominent artist in the 1920s through 1940s who is best known for his landscape paintings of the American West. He moved to Mount Carmel in 1939 shortly after marrying Edith Hamlin, a muralist from San Francisco, California. The Dixons spent their summers in the home and wintered in Tucson, Arizona. Maynard Dixon died in 1946, and Edith brought his ashes back to his Mt. Carmel home. Shortly afterward, Edith ordered the construction of a painting studio on the lot, where she created several of her notable works. Edith Dixon sold the home in 1963 to watercolor artist Milford Zornes, who occasionally used the studio. The property is on the National Register of Historic Places and is open to the public.', 'title': 'Maynard and Edith Hamlin Dixon House and Studio'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Mary Whyte (b.1953 Cleveland, Ohio) is an American watercolor artist, a traditionalist preferring a representational style, and the author of six published books, who has earned awards for her large-scale watercolors. In 2016, the Portrait Society of America chose Whyte as the 2016 recipient of the Society’s Gold Medal, their highest honor. In 2013, Whyte was awarded by the state of South Carolina, as the recipient of the South Carolina Arts Commission’s Elizabeth O'Neill Verner Governor’s Award for the Arts; the highest honor given to an artist in South Carolina.", 'title': 'Mary Whyte'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Dual naming is a policy for the naming of geographical landmarks, in which an official name is adopted that combines two previous names. Usually, the context is a conflict over which of the two previous names is most appropriate.', 'title': 'Dual naming'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Joseph F. DeMartini (born February 13, 1927) is a watercolor artist, who paints pin-up girls. He was born and raised in San Francisco, California. DeMartini was a friend and contemporary of famed Alberto Vargas. He mentored several artists, including Ted Kimer, a watercolor pin-up artist. DeMartini is one of the last pin-up artists who does not utilize modern software to create and edit his works. Below is a personal statement by Joseph F. DeMartini:', 'title': 'Joseph F. DeMartini'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The artist was born on November 3, 1979 in Malabon Metro Manila. He is known as a Watercolor artist in the Philippines. Erwin studied at the University of the East College of Fine Arts from 1997 to 2002 in Caloocan.', 'title': 'Erwin Mallari'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Don O'Neill (1924–2007) was a United States watercolor artist most noted for his depictions of historic downtown Riverside, California. An architect by trade, he began painting in the 1960s, and eventually became Riverside's premier watercolorist. O'Neill became the first resident of Southern California's Inland Empire to be accepted into the American Watercolor Society.", 'title': "Don O'Neill"}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Watercolor Artist, formerly Watercolor Magic, is an American bi-monthly magazine that focuses on watermedia techniques, trends and artists. As of June 2006, it had a print run of more than 90,000.', 'title': 'Watercolor Artist'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Joseph Stanley Kozlowski (1912–1992), American portrait and watercolor artist, was born in Frankfort, New York. The family later owned a farm in Clinton, New York and Kozlowski attended Clinton High School. He graduated from Syracuse University in 1936 with a BFA degree. In 1938 he was appointed chief artist and photographer with the Poole-Crockett archaeological expedition to study the Mayan ruins in the Yucatán Peninsula undertaken by Syracuse University. He returned to Yucatán in 1940 for a period of 8 months, using his paintings as barter for food and accommodations.', 'title': 'Joseph S. Kozlowski'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Henderson Point is a census-designated place (CDP) in Harrison County, Mississippi, United States. It is part of the Gulfport–Biloxi Metropolitan Statistical Area. The population was 170 at the 2010 census.', 'title': 'Henderson Point, Mississippi'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Lewistown is a borough in and the county seat of Mifflin County, Pennsylvania, United States. It is the principal city of the "Lewistown, PA Micropolitan Statistical Area", which encompasses all of Mifflin County. It lies along the Juniata River, 61 mi northwest of Harrisburg. The number of people living in the borough in 1900 was 4,451; in 1910, 8,166; in 1940, 13,017; and in 2000, 8,998. The population was 8,338 at the 2010 census. Of the four communities in the United States named "Lewistown", this borough is the largest.', 'title': 'Lewistown, Pennsylvania'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The McIntosh County Seat War was a dispute in Oklahoma over the location of the McIntosh County seat that took place between 1907 and 1909. Following a pair of elections that resulted in the town of Checotah being designated as the new county seat, the people of Eufaula refused to hand over the county records. As a result, a group of heavily armed men from Chectotah attempted to seize the records, but were forced to surrender during the gunbattle that ensued. One year later, after another close election, Eufaula became the permanent county seat.', 'title': 'McIntosh County Seat War'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Hendersonville is a city in Henderson County, North Carolina United States. This city is 22 miles south of Asheville. It is the county seat of Henderson County. Like the county, the city is named for 19th-century North Carolina Supreme Court Chief Justice Leonard Henderson.', 'title': 'Hendersonville, North Carolina'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Henderson is a city in Rusk County, northeast Texas, United States. The population was 13,712 at the 2010 census. It is the county seat of Rusk County. Henderson is named for James Pinckney Henderson, the first governor of Texas.', 'title': 'Henderson, Texas'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Union Township is one of the thirteen townships of Clinton County, Ohio, United States. The 2010 United States Census reported 3,085 people living in the township. The township surrounds the city of Wilmington, the Clinton County seat. Previous censuses recorded the population of Wilmington as within Union Township, and thus the township population was 14,929 at the 2000 census. The population of 3,008 living in the unincorporated portions of the township in 2000 is comparable to the 2010 entire township population.', 'title': 'Union Township, Clinton County, Ohio'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Henderson County is a county located in the U.S. state of Kentucky. As of the 2010 census, the population was 46,250. The county seat is Henderson. The county was formed in 1798 and named for Colonel Richard Henderson who purchased 17,000,000 acre of land from the Cherokee Indians, part of which would eventually make up the county.', 'title': 'Henderson County, Kentucky'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Biloxi ( ) is a city in Harrison County, Mississippi, United States. The 2010 United States Census recorded the population as 44,054, and in 2016 the estimated population was 45,975. Along with the adjoining city of Gulfport, Biloxi is a county seat of Harrison County.', 'title': 'Biloxi, Mississippi'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Jasper County Community Unit School District 1 is a unified school district based in Jasper County's county seat of Newton, Illinois; it is the only school district in the county and is, consequently, the main educational body in all of Jasper County, although it serves portions of Effingham County and Cumberland County as well. This school district is composed of six schools in total; four elementary schools, one junior high school, and one high school. There is also a prekindergarten program run at the high school of the district should parents wish to enroll their children early. Willow Hill Elementary School, which is located in the village of its namesake, serves only kindergarteners; its proximity to the county seat and central position in the county allows its students to dawn from all parts of the county and still have easy access to the elementary school they will attend. The principal of Willow Hill is Dave Parker. Grove Elementary School is located in Island Grove, Illinois, the highest point of elevation in the county. Grove Elementary School educates students from kindergarten to grade six, and it runs a prekindergarten program as well. Craig Carr is the principal of this school. Ste. Marie Elementary School is located in the southern Jasper County village of Ste. Marie, and serves students in grades one through six. The principal of Ste. Marie is David Parker, the principal of Willow Hill Elementary School. Newton Elementary School is located in the county seat of Newton, and serves most of west Jasper County's first through sixth graders under principal Travis Wyatt. The latter three elementary schools feed into Jasper County Junior High School and are taught in the facility during seventh and eighth grade while being supervised by Newton Elementary School principal Travis Wyatt before graduating into Newton Community High School. Students in grades nine through twelve spend their last leg of precollegiate education at this school; their principal is Ruth Kerner. The district superintendent is Ron Alburtus, and the district's mascot is the eagle.", 'title': 'Jasper County Community Unit School District 1'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Paulding is an unincorporated community in and one of the two county seats of Jasper County, Mississippi. It is the only unincorporated county seat in Mississippi. Settled in 1833, it was named by United States settlers in honor of Revolutionary War hero John Paulding. After its citizens refused to contribute to a new railroad, the community was bypassed in favor of Bay Springs, Mississippi, which was designated a railroad stop to the west and the second county seat. It attracted more development and industry.', 'title': 'Paulding, Mississippi'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Lennon Legend: The Very Best of John Lennon is the third official compilation album of John Lennon\'s solo career, coming after 1975\'s "Shaved Fish" and 1982\'s "The John Lennon Collection". Because neither collection spanned Lennon\'s releases up to and including 1984\'s "Milk and Honey", "Lennon Legend: The Very Best of John Lennon" – considered the definitive Lennon retrospective – was compiled to rectify the situation. It was released in the UK in 1997 through Parlophone and early 1998 in the US by EMI Records.', 'title': 'Lennon Legend: The Very Best of John Lennon'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Instant Karma: All-Time Greatest Hits, a three-disc compilation album of music recorded by John Lennon, is a budget release targeted for sale at warehouse-type stores such as Sam\'s Club and Costco. The album was released in 2002 by Timeless/Traditions Alive Music under license from Capitol/EMI Special Projects. Disc one, subtitled "The Hits", contained eleven songs that were previously released on singles. Disc two, subtitled "Sings Classic Rock \'N\' Roll", contained ten cover songs recorded during Lennon\'s "Rock \'n\' Roll" sessions as well as "Blue Suede Shoes" and "Dizzy, Miss Lizzy," which were recorded live in Toronto in 1969. Disc three, subtitled "The Classics Live", contained twelve songs recorded live in New York City either in August 1972 with Elephant\'s Memory at Madison Square Garden or, in the case of "Well (Baby Please Don\'t Go)," with Frank Zappa and The Mothers of Invention at the Fillmore East in June 1971. All thirty-five songs on the album had been previously released.', 'title': 'Instant Karma: All-Time Greatest Hits'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"I\'m Losing You" is a song written by John Lennon and released on his 1980 album "Double Fantasy". It was completed in Bermuda in June 1980, after Lennon failed at an attempted telephone call to Yoko Ono. The song is also available on the 1982 compilation "The John Lennon Collection", the 1998 boxset "John Lennon Anthology", the one disc compilation "Wonsaponatime", the 2005 two disc compilation "" and in 2010 for the "Gimme Some Truth" album. The song was also featured in the 2005 musical "Lennon".', 'title': "I'm Losing You (John Lennon song)"}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': '"How?" is a song from John Lennon\'s second solo album "Imagine", released in 1971. It is a contemplative song inspired by the Primal Therapy he was undergoing with his wife Yoko Ono, during which he faced many personal questions such as "How can I go forward when I don\'t know which way I\'m facing?" This song also shows his thoughts about the world in general (such as "And the World is so tough; Sometimes I feel I\'ve had enough").', 'title': 'How? (song)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Isolation" is a 1970 song appearing on John Lennon\'s first official solo album release, "John Lennon/Plastic Ono Band". It ends side one of the album, and is the fifth track. In the Philippines Apple Records released "Isolation" as the b-side to "Mother", the single off "John Lennon/Plastic Ono Band", in contrast to most countries where the b-side was Yoko Ono\'s "Why." It was also released on an EP in Mexico along with "Mother," "Look at Me\'" and "My Mummy\'s Dead."', 'title': 'Isolation (John Lennon song)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Rock \'n\' Roll is the sixth studio album by John Lennon. Released in 1975, it is an album of late 1950s and early 1960s songs as covered by Lennon. Recording the album was problematic and spanned an entire year: Phil Spector produced sessions in October 1973 at A&M Studios, and Lennon produced sessions in October 1974 at Record Plant Studios (East). Lennon was being sued by Morris Levy over copyright infringement of one line in his song "Come Together". As part of an agreement, Lennon had to include three Levy-owned songs on "Rock \'n\' Roll". Spector disappeared with the session recordings and was subsequently involved in a motor accident, leaving the album\'s tracks unrecoverable until the beginning of the "Walls and Bridges" sessions. With "Walls and Bridges" coming out first, featuring one Levy-owned song, Levy sued Lennon expecting to see Lennon\'s "Rock \'n\' Roll" album.', 'title': "Rock 'n' Roll (John Lennon album)"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Life Begins at 40" is a song by John Lennon. It was written in 1980, the year that both Lennon and Ringo Starr turned 40 years of age. Lennon recorded a demo of the song at his home, but it was not recorded at any of the sessions for his comeback album, "Double Fantasy." Instead, he intended to give the song to Starr to record on his own forthcoming album, "Can\'t Fight Lightning." The song\'s amiable country feel was well suited to Starr\'s singing style. After Lennon\'s murder in December 1980, those plans were shelved. However, Lennon\'s demo was eventually issued in 1998 on the "John Lennon Anthology" box set.', 'title': 'Life Begins at 40 (song)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Milk and Honey is an album by John Lennon and Yoko Ono released in 1984. Following the compilation "The John Lennon Collection", it is Lennon\'s eighth and final studio album, and the first posthumous release of new Lennon music, having been recorded in the last months of his life during and following the sessions for their 1980 album "Double Fantasy". It was assembled by Yoko Ono in association with the Geffen label.', 'title': 'Milk and Honey (album)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Imagine is the second studio album by John Lennon. Recorded and released in 1971, the album is more heavily produced in contrast to the basic, raw arrangements of his previous album, the critically acclaimed "John Lennon/Plastic Ono Band".', 'title': 'Imagine (John Lennon album)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Hold On" is a song from the album "John Lennon/Plastic Ono Band" by John Lennon. It features only vocals, tremolo guitar, drums, and bass guitar, typical of the sparse arrangements Lennon favoured at the time. On the 2000 reissue of "John Lennon/Plastic Ono Band", "Hold On" features a slightly longer introduction. The original version was restored on the 2010 reissue.', 'title': 'Hold On (John Lennon song)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Pontins is the trading name of Britannia Jinky Jersey Ltd, a company operating holiday parks in the UK. The original Pontins company was founded in 1946 by Fred Pontin.', 'title': 'Pontins'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'LeSourdsville Lake Amusement Park was an amusement park located in Middletown, Ohio. Opening in 1922 as a family picnic and campground, LeSourdsville Lake transformed in the 1940s to an amusement park with rides, attractions, and an arcade. In 1977, the name was changed to Americana Amusement Park. Following an electrical fire in 1990 that caused over $5 million in damages, the park fell into decline and was eventually closed in 1999. Under new ownership, the park briefly opened again in 2002 returning to the name "LeSourdsville Lake Amusement Park", but after failed attempts to turn a profit and the operating company going bankrupt, it closed permanently near the end of the 2002 season. The park\'s remaining rides and attractions were either demolished or sold, or still sit today.', 'title': 'LeSourdsville Lake Amusement Park'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Wonderland City was an amusement park located at Tamarama, on Wonderland Avenue near the point at which it joins Fletcher Street, in Sydney, Australia. It opened on Saturday, 1 December 1906 and closed in 1911. At the time it was the largest open air amusement park in the southern hemisphere. The 20 acre amusement park was operated by theatrical entrepreneur William Anderson. During its operation the colossal playground had a balloon could go up to about 3,800 feet (1158.24 meters) high. An enormous switchback railway and around the clifftop, a steam-driven miniature railway operated over about two miles (3.218688 km) of track. A large wooden bridge build over an artificial lake, the Alpine Slide would take you to "Rivers of the World", Seal Pond. An open air Roller Skating Ring, American Shooting Gallery. It was operated by electric light powered by its own steam plant, and the whole area was covered with thousands of gaily coloured lamps and described as a Fairy City. The first Surf "Gymkhana" Carnivals was held at Wonderland City (Tamarama Beach) organised by Bondi SBLSC on Saturday 11 February 1908. was dogged by controversy for its attempts using high barbed-wire fence blocked access completely to local swimmers from Tamarama Beach. Before being occupied by the amusement park, Tamarama Park was the site of The Royal Aquarium and Pleasure Grounds, commonly called the Bondi Aquarium.', 'title': 'Wonderland City'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Palisades Amusement Park was a 30-acre amusement park located in Bergen County, New Jersey, across the Hudson River from New York City. It was located atop the New Jersey Palisades lying partly in Cliffside Park and partly in Fort Lee. The park operated from 1898 until 1971, remaining one of the most visited amusement parks in the country until the end of its existence. After the park closed in 1971, a high-rise luxury apartment complex was built on its site.', 'title': 'Palisades Amusement Park'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'All Tomorrow\'s Parties was an organisation based in London that promoted music festivals, concerts and records throughout the world for over ten years. It was founded by Barry Hogan, in 2001 in preparation for the first All Tomorrow\'s Parties Festival, the line-up of which was curated by Mogwai and took place at Pontins, Camber Sands, England. Named after the song "All Tomorrow\'s Parties" by The Velvet Underground, the festival exhibited a tendency towards post-rock, avant-garde, and underground hip hop, along with more traditional rock fare presented in an environment more intimate than a giant stadium or huge country field. It was at first a sponsorship-free festival where the organisers and artists stay in the same accommodation as the fans. It claimed to set itself apart from festivals like Reading or Glastonbury by staying intimate, non-corporate and fan-friendly. Another vital difference is that the line-ups are chosen by significant bands or artists, resulting in unorthodox events which often combine acts of all sizes, eras, and genres.', 'title': "All Tomorrow's Parties (festival)"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Major Stars is a critically acclaimed American psychedelic rock band from greater Boston, Massachusetts. Their first live performance was in 1997 at the inaugural Terrastock Festival in Providence, Rhode Island. They toured Japan in 2000 with Overhang Party. In 2002, they toured with Acid Mothers Temple as an opening act and performed at the South by Southwest Festival in Austin, Texas. In December 2006 they performed at the Thurston Moore curated All Tomorrow's Parties festival in the UK.", 'title': 'Major Stars'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'A family entertainment center (or centre), often abbreviated FEC in the entertainment industry, (also known as indoor amusement park or indoor theme park) is a small amusement park marketed towards families with small children to teenagers, and often entirely indoors or associated with a larger operation such as a theme park. They usually cater to "sub-regional markets of larger metropolitan areas." FECs are generally small compared to full-scale amusement parks, with fewer attractions, a lower per-person per-hour cost to consumers than a traditional amusement park, and not usually major tourist attractions, but sustained by an area customer base. Many are locally owned and operated, although there are a number of chains and franchises in the field. FECs are sometimes called family amusement centers, play zones, family fun centers, or simply fun centers. Some non-traditional FECs, called urban entertainment centers (UECs), with more customized and branded attractions and retail outlets, are associated with major entertainment companies and may be tourist destinations. Others, sometimes operated by Non-Profit organizations as Children\'s Museums or Science Centers, tend to be geared toward edutainment experiences rather than simply amusement. FECs may also be adjuncts to full-scale amusement parks.', 'title': 'Family entertainment center'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Lake Compounce is an amusement park located in Bristol and Southington, Connecticut; the lake itself lies completely in Southington. Opened in 1846, it is the oldest continuously-operating amusement park in the United States. The amusement park covers 332 acres (1.3\xa0km²) of land, and also has a beach and a waterpark which can be used by guests for no extra charge. The park was acquired from Kennywood Entertainment Company by Palace Entertainment, the U.S. subsidiary of Parques Reunidos. In addition to the title for oldest consecutively run amusement park in the United States, it also has 14th oldest wooden roller coaster in the world, Wildcat. Its other, newer wooden roller coaster, Boulder Dash, has won the Golden Ticket Award for the #1 Wooden Coaster in the World for 5 years, and held that record from 2013 to 2016.', 'title': 'Lake Compounce'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Yokohama Dreamland was an amusement park that operated in Totsuka, Yokohama, Japan from 1964 to 2002. When opened on August 1, 1964, it was Japan's first major amusement park, with a total area of 1320000 m2 . The management company, , was acquired by the supermarket chain Daiei in 1993, and the amusement park closed permanently on February 17, 2002, due to financial issues. At the time of its closing, the amusement park was downsized to 145776 m2 .", 'title': 'Yokohama Dreamland'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Wildwood was an amusement park and picnic grounds that existed from 1889 through 1932 on the southeast shore of White Bear Lake in Mahtomedi, Minnesota. The park was built and operated by the Minneapolis and St. Paul Suburban Railroad Company, a subdivision of the Twin City Rapid Transit Company, which ran a streetcar line from Mahtomedi to nearby St. Paul. It was the sister park of Big Island Amusement Park on Lake Minnetonka, as both were intended to draw crowds of people to opposite ends of the Minneapolis-St. Paul streetcar system on weekends. Wildwood Amusement Park proved to be more successful than Big Island Amusement Park, which closed in 1911, and lasted until 1932 when financial losses brought about its demise.', 'title': 'Wildwood Amusement Park'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Custody is a 2007 Lifetime television movie, starring Rob Morrow, James Denton, and Kay Panabaker about a widower\'s fight for custody of the daughter he raised and legally adopted, when her birth father who abandoned her returns. Aired on September 8, 2007. It was filmed in and around Ottawa on locations such as the University of Ottawa, Rideau Canal, and Le Chateau Montebello. It was based on the book "Figures of Echo", by Mary S. Herczog.', 'title': 'Custody (2007 film)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Moondance Alexander is a comedy-drama film directed by Michael Damian and written by Janeen Damian. The film was released in North America in October, 2007. The story is shot on location in Okotoks, High River and Calgary, Alberta, Canada and is based on actual events from the life of Janeen Damian. It stars former Summerland (TV series) co-stars Kay Panabaker as Moondance Alexander and Lori Loughlin as Gelsey Alexander. The movie co-stars Don Johnson and Olympic-skating silver medalist Sasha Cohen.', 'title': 'Moondance Alexander'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Life Is Ruff is a 2005 Disney Channel Original Movie starring Kyle Massey, Mitchel Musso, and Kay Panabaker.', 'title': 'Life Is Ruff'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Stephanie Kay Panabaker (born May 2, 1990) is an American actress, voice actress, and zookeeper. She is best known for her roles as Jenny Garison in the 2009 reboot of "Fame", Debbie Berwick on "Phil of the Future" and Nikki Westerly on "Summerland". She is the younger sister of Danielle Panabaker.', 'title': 'Kay Panabaker'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Beverly Hills Chihuahua 3: Viva la Fiesta! is a 2012 American direct-to-DVD comedy film directed by Lev L. Spiro. It is the third and final installment of the "Beverly Hills Chihuahua" series, and stars George Lopez, Odette Annable and Logan Grove. The film focuses on Papi, Chloe and the puppies moving to a hotel. Pedro finds love when he falls head over heels for Charlotte. The film was released by Walt Disney Studios Home Entertainment on September 18, 2012 in a two-disc Blu-ray/DVD combo pack. Zachary Gordon and Chantily Spalan did not reprise their roles as Papi, Jr. and Rosa. This was Kay Panabaker\'s final film before she retired to become a zoologist.', 'title': 'Beverly Hills Chihuahua 3: Viva la Fiesta!'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Nancy Drew is a 2007 American mystery comedy film loosely based on the popular series of mystery novels about the titular teen detective. It stars Emma Roberts as Nancy Drew, Max Thieriot as Ned, Kay Panabaker as George, and Amy Bruckner as Bess Marvin. Set in Los Angeles, it was directed by Andrew Fleming.', 'title': 'Nancy Drew (2007 film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Danielle Nicole was previously in the band Trampled Under Foot with her brothers Kris and Nick Schnebelen. At the 2014 Blues Music Awards, Trampled Under Foot\'s album, "Badlands", won the \'Contemporary Blues Album of the Year\' category. At the same ceremony, Danielle Nicole, under the name of Danielle Schnebelen, triumphed in the \'Best Instrumentalist – Bass\' category. The band was also nominated in the \'Band of the Year\' category.', 'title': 'Danielle Nicole'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Danielle Nicole Panabaker (born September 19, 1987) is an American actress. She began acting as a teenager and first came to prominence for her roles in the Disney films "Stuck in the Suburbs" (2004), "Sky High" (2005) and "Read It and Weep" (2006), the latter alongside her younger sister Kay Panabaker, and in the HBO miniseries "Empire Falls" (2005).', 'title': 'Danielle Panabaker'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Little Birds is a 2011 American film written and directed by Elgin James, and starring Juno Temple and Kay Panabaker. The film follows two girls that leave home to follow two skateboarders to Los Angeles and is loosely based on the life of director Elgin James. The film premiered at the Sundance Film Festival, with Millennium Entertainment acquiring the North American rights to the film.', 'title': 'Little Birds (film)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Read It and Weep is a 2006 Disney Channel Original Movie which premiered on July 21, 2006. It is based on the novel "How My Private, Personal Journal Became A Bestseller" by Julia DeVillers. Sisters Kay and Danielle Panabaker star as Jamie Bartlett and her alter ego Isabella (Iz or Is), respectively. Both sisters have starred in previous Disney Channel films: Kay in "Life Is Ruff" (2005), and Danielle in "Stuck in the Suburbs" (2004), like "Read It and Weep", those films also premiered in July in their respective years.', 'title': 'Read It and Weep'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Henkel AG & Company, KGaA, is a German chemical and consumer goods company headquartered in Düsseldorf, Germany. It is a multinational company active both in the consumer and industrial sector. Founded in 1876, the DAX 30 company is organized into three globally operating business units (laundry & home care, beauty care, adhesive technologies) and is known for brands such as Loctite, Persil, and Fa amongst others.', 'title': 'Henkel'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Namsung (Hangul:\xa0 ; ] ) is a South Korean multinational company headquartered in Seoul. Namsung was founded by Yoon Bong-Soo in 1965 as an OEM electronics manufacturing company. Namsung's subsidiaries include Namsung Telecom, Nasco, Dreamer, Namsung International, and Namsung America.", 'title': 'Namsung electronics'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Stevanato Group is an Italian multinational company headquartered in Piombino Dese, Padua – Italy. Founded in 1949, It is committed to create systems, processes and services that guarantee the integrity of parenteral medicines.', 'title': 'Stevanato Group'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "General Mills, Inc., is an American multinational manufacturer and marketer of branded consumer foods sold through retail stores. It is headquartered in Golden Valley, Minnesota, a suburb of Minneapolis. The company markets many well-known North American brands, including Annie's Homegrown, Betty Crocker, Yoplait, Colombo, Totino's, Pillsbury, Old El Paso, Häagen-Dazs, Cheerios, Trix, Cocoa Puffs, and Lucky Charms. Its brand portfolio includes more than 89 other leading U.S. brands and numerous category leaders around the world.", 'title': 'General Mills'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'RetailMeNot, Inc. (formerly Whaleshark Media) is an American multinational company headquartered in Austin, that maintains a collection of coupon web sites. The company was founded by Cotter Cunningham. The company owns RetailMeNot.com and VoucherCodes.co.uk, the largest coupon sites in the US and UK, respectively, and acquires coupon sites and third-party software.', 'title': 'RetailMeNot'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Teleperformance is a multinational company headquartered in France. The company specializes in outsourced omnichannel customer experience management, also known as Business Process Outsourcing (BPO). The company provides customer acquisition, customer care, technical support, debt collection, social media, and other services around the world. Teleperformance has 217,000 employees across 340 contact centers in 74 countries and serves over 160 markets. Countries in which Teleperformance operates include France, the United Kingdom, Albania, Brazil, Chile, India, Philippines, Guyana,China, Canada, Mexico, Colombia, Norway, Italy, Greece, Portugal, the United States, Costa Rica, Dominican Republic, Australia, the Netherlands, Suriname, Egypt, Russia, Sweden, Germany and Poland.', 'title': 'Teleperformance'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Corey Smith (born October 3, 1977) is a contemporary American painter, sculptor, photographer, professional snowboarder, and snowboard designer. Smith was the art director at COMUNE, curator and founder of their Drop City artist collective (which he is no longer a part of), and a contributing artist for CAPiTA Snowboards. In addition, Smith founded the snowboard company Spring Break Snowboards.', 'title': 'Corey Smith (artist)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Robert Smith (June 12, 1802 – December 21, 1867) was a U.S. Representative from Illinois, nephew of Jeremiah Smith and Samuel Smith of New Hampshire. Smith founded General Mills in 1856.', 'title': 'Robert Smith (Illinois politician)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Hyrum W. Smith founded the Franklin Quest Company in 1981. Among the company\'s other products, Smith created the Franklin Planner and seminars on productivity development based on the "belief window" and other concepts. In 1997, Franklin Quest merged with Stephen R. Covey\'s Covey Leadership Center to form Franklin Covey. Smith is author of "10 Natural Laws of Successful Time and Life Management" (1994) and "What Matters Most" (2001) as well as other audio tapes.', 'title': 'Hyrum W. Smith'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Equinix, Inc. is an American multinational company headquartered in Redwood City, California, that specializes in enabling global interconnection between organizations and their employees, customers, partners, data and clouds. The company is the leading global colocation data center provider by market share, and it operates 175+ data centers in 44 major metropolitan areas in 22 countries on five continents.', 'title': 'Equinix'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Francisco Icaza (5 October 1930 – 3 May 2014) was a Mexican artist best known for his drawings about his traveling chronics, and his oil paintings. He spent much of his life living and visiting various countries in the world. He began painting as a child at the refugee against the bombs in the Mexican embassy in Germany during the rise of nazism, he painted as a posture against the war. Icaza exhibited his work both in Mexico and abroad in Europe, South America, Middle East, Asia and India, standing out his three major individual exhibitions at the Museo de Arte Moderno at México city. He also painted a mural dedicated to Bertolt Brecht: La Farándula, at the Casino de la Selva in Cuernavaca, a focus of controversy when the work was moved and restored in the early 2000s. He painted other murals for the Mexican Pavilion at Hemisfair in Houston Texas: Urban Flowers, for the Mexican Pavilion at Montreal Canada: Canto al Barroco Maya; and, for the Pavilion of México in Osaka: Repressive Computers, this mural is protected at the Abstract Museum Manuel Felguerez in Zacatecas, Zacatecas, and is part of the other murals of Osaka considered as a human patrimony. He was an active member of the Salón de la Plástica Mexicana, and also member and founder of the important artistic movements : Interiorists, Independent Saloon, and Confrontation 66.', 'title': 'Francisco Icaza'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'State Route 234 (SR 234) is a primary state highway in the U.S. state of Virginia. It runs from U.S. Route 1 near Dumfries via Independent Hill, a bypass of Manassas, and Catharpin to U.S. Route 15 near Woolsey.', 'title': 'Virginia State Route 234'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'State Route 619 is a secondary state highway in the U.S. state of Virginia, and traverses Prince William County. SR 619 provides a cross-county connector as well as a major artery for commuters. SR 619 is known by four names: Linton Hall Road, Bristow Road, Joplin Road, and Fuller Heights Road. There are also two short concurrencies: one with SR 234 Old in Independent Hill, and one with Fuller Military Road on the border of Marine Corps Base Quantico.', 'title': 'Virginia State Route 619 (Prince William County)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Citgo Petroleum Corporation (or Citgo) is a Venezuelan-owned American refiner, transporter and marketer of transportation fuels, lubricants, petrochemicals and other industrial products. The company has its American headquarters in the Energy Corridor area of Houston, Texas.', 'title': 'Citgo'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Elder William M. Smoot William M. Smoot (about 1848-1938) was a resident of Occoquan, Virginia and for many years was a leading Predestinarian Old School Primitive Baptist preacher in Prince William County. He was the preacher of Occoquan (also known as Bacon Race to those outside the membership of those associated with Elder Smoot) and Quantico Baptist churches from 1888 to 1938. A GOD-called preacher of the original faith and order of the Baptists in America, Elder Smoot, whose followers were known locally as "Smootites," engaged in a heated rivalry over doctrine and practice as set forth in the Bible(KJV) with the reverend Thomas D.D. Clark, whose Union Baptist Church was located across the road from the Quantico Baptist Church in the village of Independent Hill.', 'title': 'William Smoot'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Houston Boychoir is a nonprofit, independent vocal training and music education organization in Greater Houston Texas.', 'title': 'Houston Boychoir'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Dominic Walsh Dance Theater (DWDT) is a contemporary dance company based in Houston Texas. Started by artistic director and former principal dancer for the Houston Ballet, Dominic Walsh, DWDT ranges from progressive to classical choreography.', 'title': 'Dominic Walsh Dance Theater'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Houston Dynamos was a U.S. soccer team that existed in various forms from 1983 to 1991. In 1991, the team’s owners changed the name to Houston International, but the team lasted only through the 1992 season before folding. The Dynamos were founded by Pete Kane and John M Gaughan. The Dynamos were founded with the intention of a continued building of the sport of soccer in Houston Texas. The Dynamos were the first team to give contracts to its players based on an entire year not on a season. The Houston Dynamos players year round went to parks, schools and events promoting the sport of soccer. In 1985 the Dynamos brought Pele to Houston creating great interest in the sport and spreading goodwill.', 'title': 'Houston Dynamos'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Independent Hill is an unincorporated town in Prince William County, Virginia. It is located along State Route 234 at the intersection with Joplin Road. The only visible remaining businesses seem to be Samsky's Market (also a Citgo gas station) and Crosby's Crab Company. In early 2006, a realignment of 234 bypassed the town, leaving it on a side road. The greater Independent Hill area is defined by the Census Bureau as a census-designated place (CDP), with a population of 7,419 as of 2010.", 'title': 'Independent Hill, Virginia'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "KHB36 (sometimes referred to as Manassas All Hazards) is a NOAA Weather Radio station broadcasting at 162.55 megahertz and transmitting from Independent Hill in central Prince William County, Virginia. It covers most of northern Virginia, Washington, D.C., and southern Maryland. It is programmed from the National Weather Service forecast office in Sterling, Virginia. The signal reliably covers the Virginia counties of Prince William, Fairfax, Arlington, Loudoun, Fauquier, Rappahannock, Culpeper, Spotsylvania, Caroline, King George, and Stafford. Reception is also possible in the Maryland counties of Montgomery, Prince George's, and Charles County, Maryland. Additionally, reception is possible but unreliable in the Virginia counties of Clarke, Frederick, Orange, Louisa, Hanover, Essex, Richmond (no relation to the capital city of the state, which is not covered), and Northumberland, plus Calvert County, Maryland and Anne Arundel County, Maryland.", 'title': 'KHB36'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The "City Building" series is the collective name of a series of historical city-building games for personal computers developed by Impressions Games, BreakAway Games, Tilted Mill Entertainment (following Impressions\' demise), and published by Sierra Entertainment. The series began in 1992 with "Caesar", set in the Roman Empire, and so far consists of twelve games, including expansion packs.', 'title': 'City Building (series)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'An orc (also spelled as ork) is a fictional humanoid creature that is part of a fantasy race akin to goblins.', 'title': 'Orc'}
