 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Keith Zizza is a video game soundtrack composer. He has worked as a composer and audio director for companies such as Electronic Arts, Impressions Games, Sierra Entertainment and Tilted Mill Entertainment. His discography includes more than 25 AAA game titles. In April 2008 Zizza released his debut solo album, "Memories of a Forgotten Age".', 'title': 'Keith Zizza'}
