 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Hinterland is a high fantasy role-playing video game with city-building elements by Tilted Mill Entertainment. It was released on September 30, 2008 on the Steam content delivery system, and has since been made available at other digital distribution websites. Hinterland: Orc Lords, a cumulative expansion, was released to digital distribution and retail in March 2009. As the title suggests, the primary addition to the game was the ability to play as Orc characters.', 'title': 'Hinterland (video game)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Tilted Mill Entertainment is a video game developer located in Framingham, Massachusetts. It was founded in 2001 by former Impressions Games lead designer and general manager Chris Beatrice, business manager Peter Haffenreffer, and designer Jeff Fiske.', 'title': 'Tilted Mill Entertainment'}
