 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'SimCity Societies is a city-building simulation computer game developed by Tilted Mill Entertainment and published by Electronic Arts (EA), and is part of the "Sim" games series. The gameplay is significantly different from previous "SimCity" titles, with a greater focus on social development. "SimCity Societies" was released on November 13, 2007 and received mixed reviews, with praise for the game\'s improved accessibility and visuals, but criticism for being oversimplified and having poor performance.', 'title': 'SimCity Societies'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Bambi\'s Children: The Story of a Forest Family (German: Bambis Kinder: Eine Familie im Walde ) is a novel written by Austrian author Felix Salten as a sequel to his successful work "Bambi, A Life in the Woods".', 'title': "Bambi's Children"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '«Airship. From Zedlitz» ("«On the blue waves of the ocean ..." ») (Russian: «Возду́шный кора́бль. Из Це́длица» («По синим волнам океана…») ) is a ballad from the Napoleonic cycle Lermontov\'s poems, written and published in 1840. It is a free translation from the German language Austrian romantic writings of Joseph Christian Freiherr von Zedlitz, titled "Das Geisterschiff" ("ghost ship", 1832). The individual fragments Russian poem was influenced by another ballad of the same Austrian author - "Night parade" (Die nächtliche Heerschau; 1827), published in Russian in 1836 in translation by Zhukovsky.', 'title': 'Airship (ballad)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Dr Ernst Weiss (German: Weiß, August 28, 1882 – June 15, 1940) was a German-speaking Austrian author of Jewish descent. He is the author of "" (The Eyewitness), a novel dealing with the Hitler period.', 'title': 'Ernst Weiss'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Anna Wilhelmine Gmeyner (16 March 1902 – 3 January 1991) was an exiled German and Austrian author, playwright and scriptwriter, who is now best known for her novel "Manja" (1939). She also wrote under the names Anna Reiner, and Anna Morduch. Her daughter was the children\'s writer Eva Ibbotson.', 'title': 'Anna Gmeyner'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Bone Man (German: Der Knochenmann) is a 2009 Austrian film directed by Wolfgang Murnberger. The script is based on the novel "Der Knochenmann" by Austrian author Wolf Haas.', 'title': 'The Bone Man'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The Bachelor (also known as Mio caro dottor Gräsler ) is a 1990 drama film directed by Roberto Faenza and starring Keith Carradine, Miranda Richardson and Kristin Scott Thomas. It is set in the Austro-Hungarian Empire before the First World War. Doctor Emil Gräsler, a distinguished physician, is forced to choose between two women he loves. It is based on the novel "Dr. Gräsler, Badearzt" by Arthur Schnitzler.', 'title': 'The Bachelor (1990 film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Eva Menasse (born May 11, 1970 in Vienna) is an Austrian author and journalist. She has studied history and German literature. Menasse had a successful career as a journalist, writing for the Frankfurter Allgemeine Zeitung in Frankfurt and as a correspondent from Prague and Berlin. She left the paper to write her first novel, "Vienna", and now lives and works in Berlin as a freelance author.', 'title': 'Eva Menasse'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Trotta is a 1971 West German film directed by Johannes Schaaf. It is based on the 1938 novel "Die Kapuzinergruft" ("The Emperor\'s Tomb") by Austrian author Joseph Roth. It was chosen as West Germany\'s official submission to the 45th Academy Awards for Best Foreign Language Film, but did not manage to receive a nomination. It was also entered into the 1972 Cannes Film Festival.', 'title': 'Trotta (film)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Arthur Schnitzler (15 May 1862 – 21 October 1931) was an Austrian author and dramatist.', 'title': 'Arthur Schnitzler'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Robber (German: Der Räuber ) is a 2010 drama film directed by Benjamin Heisenberg. The film is based on a novel by the Austrian author Martin Prinz, and was shot on location in Vienna. The main character, Johann Rettenberger, is based on Austrian bank-robber and runner Johann Kastenberger. The film was nominated for the Golden Bear at the 60th Berlin International Film Festival.', 'title': 'The Robber'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Railroad Square Art Park is an arts, culture and entertainment district of Tallahassee, Florida, located off Railroad Avenue (just south of the Amtrak station and FAMU), filled with a variety of metal art sculptures and stores selling artwork and collectibles. Railroad Square is mainly known for its small locally owned shops and working artist studios, and its alternative art scene. It is also known as home to the second location of Tallahassee's long-serving local business staple Black Dog Cafe. On the first Friday of every month, Railroad Square is home to a free gallery hop known as First Friday from 6pm-9pm, where a diverse group of upwards of 5000-7000+ Tallahasseeans of all ages come to meet their friends and experience art.", 'title': 'Railroad Square'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'City Market in Raleigh is a market located in Raleigh, North Carolina, United States. It was founded in October, 1914. It became known as a historic place when Raleigh City Council secured a grant from the North Carolina Division of Archives & History to study the architectural resources surrounding Moore Square, in 1980. It is one of the major tourist attractions in Raleigh. In early May, 2008, the market was the location of an art project unveiling by the Visual Art Exchange. The market hosts a monthly festival, called "First Friday", on the first Friday of every month.', 'title': 'City Market (Raleigh, North Carolina)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Whit Friday, meaning White Friday, is the name given to the first Friday after Pentecost or Whitsun (White Sunday).', 'title': 'Whit Friday'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Gallery5 is an arts center, museum, gallery, venue, and community space in Richmond, VA. It is located at 200 West Marshall Street in Richmond, VA, in the historic Jackson Ward neighborhood. Gallery5 is housed in the original building of Steamer Company Number 5, which is the oldest firehouse in Virginia, dating back to 1867. This historic building has seen many incarnations; in addition to the original fire station the building has also served as a police station, a Fire and Police Museum, and a hot dog emporium. The gallery is a cornerstone participant in Richmond's monthly First Friday Art Walk, which takes place on the first Friday of every month and draws artists and art-enthusiasts in throngs to Downtown Richmond.", 'title': 'Gallery 5'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Heckscher Park is a local park and national historic district in Huntington, Suffolk County, New York. It is bounded by Madison Street, Sabbath Day Path, Main Street, and Prime Avenue. The park is roughly triangular-shaped with a large pond on northwest corner, and contains the Heckscher Museum of Art established by industrialist August Heckscher, as well as the Chapin Rainbow Theater. It hosts annual art festivals, tulip festivals, concerts, renaissance fairs, and the Huntington Summer Arts Festival. Heckscher Park was listed on the National Register of Historic Places in 1985.', 'title': 'Heckscher Park (Huntington, New York)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Howard G. (Peter) Sloane (born December, 1950) is an American philanthropist and the Chairman and CEO of The Heckscher Foundation for Children, a New York-based private foundation established in 1921 by German-born industrialist, financier, and philanthropist August Heckscher.', 'title': 'Howard Sloane'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"First Friday" is a name for various public events in some cities (particularly in the United States) that occur on the first Friday of every month.', 'title': 'First Friday (public event)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Heckscher Museum of Art is located in scenic Heckscher Park, in Huntington, New York, within walking distance of downtown shops and award-winning restaurants. The Museum provides a dynamic schedule of changing exhibitions on American art. Additionally, public programs for adults, families, and children, include "First Friday" concert series, gallery talks, festivals and workshops.', 'title': 'Heckscher Museum of Art'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'NBA Friday is a weekly presentation of National Basketball Association games on ESPN. Formerly known as "NBA Friday Coast to Coast" during doubleheader nights, the program starts the first Friday of the NBA season, and typically runs uninterrupted throughout the entire season. In 2006, "NBA Friday" was preempted from March 10 to March 31, due to ESPN deciding against counter programming the NCAA Tournament. Nearly all "NBA Friday" telecasts consist of a doubleheader, with one game typically from the east coast at 8:00 p.m and the west coast at 10:30\xa0p.m.', 'title': 'NBA Friday'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Heritage Acres Farm Museum is an open-air museum in southern Alberta, Canada. In particular it showcases antique machinery and vintage cars. Buildings from surrounding communities have been moved to the historic site and restored to various years within the twentieth century including a historic prairie grain elevator and many different forms of farm machinery and equipment from the 1900s to 1960s. As well the "Crystal Village" a miniature village of various buildings made completely from telephone insulators made by a local rancher. Heritage Acres Farm Museumhosts annual events including a garage sale in May, Chuckwagon cookoff and horse show in June, Annual show with many farming demonstrations August long weekend, candlelight church service first Friday in December and a Breakfast with Santa the first Saturday in December.', 'title': 'Heritage Acres Farm Museum'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Snegithiye (English:Oh Friend! " (female)" ) is a 2000 Tamil mystery thriller film directed by Priyadarshan. The story is loosely based on the 1999 Marathi film "Bindhaast" written by Chandrakant Kulkarni. The film notably features only female characters in the lead roles, played by Jyothika, Sharbani Mukherjee, Tabu and Ishita Arun. Music was composed by Vidyasagar. The film, released in 2000, proved to be an average grosser at the box office but bagged positive reviews from critics. Today, it is considered a cult classic that was underrated at the time of its release. Originally planned to be made as a bilingual, in Tamil and in Malayalam, the film released first in Tamil only, while the Malayalam dubbed version, "Raakilipattu", as well as the dubbed Hindi version, "Friendship", released seven years later.', 'title': 'Snegithiye'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Havenhurst is a 2017 American horror film directed by Andrew C. Erin and starring Julie Benz.', 'title': 'Havenhurst'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Game in Kannada, Oru Melliya Kodu (English: A thin line) in Tamil, is a 2016 Indian bilingual language crime thriller film directed by A. M. R. Ramesh. This movie is an unofficial remake of the 2012 Spanish thriller El Cuerpo (Spanish title) also known as "The Body", and features Arjun Sarja, Shaam and Manisha Koirala in the lead roles. With music composed by Ilayaraaja, the film was simultaneously shot in Kannada and Tamil; the former released first on February 26, 2016 while the later released on July 1, 2016. The film was dubbed and released in Telugu as "Notuku Potu" in 2017.', 'title': 'Game (2016 film)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Julie Marie Benz (born May 1, 1972) is an American actress, best known for her roles as Darla on "Buffy the Vampire Slayer" and "Angel" (1997–2004) and Rita Bennett on "Dexter" (2006–2010), for which she won the 2006 Satellite Award for Best Supporting Actress and the 2009 Saturn Award for Best Supporting Actress. She has also starred on the series "Roswell" (1999–2000), "Desperate Housewives" (2010), "No Ordinary Family" (2010–2011), "A Gifted Man" (2011–2012), "Defiance" (2013–2015), and "Hawaii Five-0" (2015–present). Her film roles include "Jawbreaker" (1999), "The Brothers" (2001), "Rambo", "Saw V" and "" (2008), "" (2009), and "Bedrooms" (2010).', 'title': 'Julie Benz'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Fanny and Alexander (Swedish: Fanny och Alexander ) is a Swedish drama film which was released to cinemas in Sweden on 17 December 1982, written and directed by Ingmar Bergman. The plot focuses on two siblings and their large family in Uppsala, Sweden in the 1900s. It was originally conceived as a four-part TV movie and cut in that version, spanning 312 minutes; a 188-minute cut version was created later for cinematic release, although this version was in fact the one to be released first. The TV version has since been released as a complete film, and both versions have been shown in theaters throughout the world. The 312-minute (five-hour, twelve-minute) cut is one of the longest cinematic films in history.', 'title': 'Fanny and Alexander'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Suhasini Rajaram Naidu, popularly known by her stage name Sneha, is an Indian film actress, who works in the South Indian film industry. She debuted in the Malayalam film "Ingane Oru Nilapakshi" (2000), directed by Anil – Babu and was later signed for the Tamil film "Virumbugiren", though it was only released two years later. She started getting offers in Tamil and moved her focus to Kollywood, and the movie "Ennavale", where she starred opposite R. Madhavan, was released first in the same year.', 'title': 'Sneha (actress)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'BlazBlue: Chrono Phantasma, released in Japan as BlazBlue: Chronophantasma (ブレイブルー クロノファンタズマ , BureiBurū Kuronofantazuma ) , is a 2-D fighting game developed by Arc System Works. It is the third game of the Blazblue series, set after the events of "". The game was originally to be released first as an arcade game in the early fourth quarter of 2012, which was later pushed forward to November 2012. A PlayStation 3 version of the game was released in Japan on October 24, 2013, while it was released in the United States on March 25, 2014. Due to limited hardware and disc space the game was not released on the Xbox 360. An updated version of the game titled BlazBlue: Chrono Phantasma Extend (ブレイブルー クロノファンタズマ エクステンド , BureiBurū: Kuronofantazuma Ekusutendo , BlazBlue: Chronophantasma Extend) , dubbed as BlazBlue: Chrono Phantasma 2.0 (ブレイブルー クロノファンタズマ ２.０ , BureiBurū: Kuronofantazuma 2.0 , BlazBlue: Chronophantasma 2.0) in the Arcade version, was originally released for Arcades in October 2014, and for the PlayStation 3, PlayStation Vita, PlayStation 4, and Xbox One in April 2015. It was released on June 30, 2015 in North America, with the European region version releasing on October 23, 2015.', 'title': 'BlazBlue: Chrono Phantasma'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Toys in the Attic (Czech: Na půdě aneb Kdo má dneska narozeniny? ; festival title: In the Attic: Who Has a Birthday Today?) is a 2009 Czech-French-Japanese-Slovak primarily stop-motion animated fantasy comedy thriller family film directed by Jiří Barta and written by Edgar Dutka and Barta which depicts a community of toys and other objects in an attic who come to life when no human is around. It is an international co-production of Czech, Japanese and Slovak companies. The film was released first in the Czech Republic on 5 March 2009 and has been shown subtitled at film festivals internationally. An American dub – adapted, produced and directed by Vivian Schilling and performed by actors including Forest Whitaker, Joan Cusack, Cary Elwes and Schilling herself – has been recorded, which the film was first shown with on 3 March 2012 at the New York International Children's Film Festival and was released nationally on 24 August 2012 by Hannover House.", 'title': 'Toys in the Attic (2009 film)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Midnite Movies is a line of B movies released first on VHS and later on DVD by MGM Home Entertainment. The line was begun by MGM in March 2001 following its acquisition of Orion Pictures, which bought out Filmways, the owner of American International Pictures. AIP had a library of B movies from the 1950s and 1960s that were science fiction, horror, and exploitation films. The "Midnite Movies" collection is primarily derived from the AIP library (including most of Roger Corman\'s and Vincent Price\'s horror movies) but also included Hammer Film Productions, Amicus Productions, United Artists, and Empire International Pictures movies as well. The DVDs were first released as single films but most later releases would be double features on single double-sided discs. Sony Pictures Home Entertainment later became owners of the MGM library and continued the "Midnite Movies" line with distributor 20th Century Fox Home Entertainment. All double feature titles released on the 20th Century Fox label were two-disc packages. By 2011, no new titles were forthcoming; the previous catalog titles slowly went out of print and the "Midnite Movies" website was taken down.', 'title': 'Midnite Movies'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Deewana (English: \'Crazy\' ) is a 1992 Indian romantic drama film directed by Raj Kanwar, and produced by Guddu Dhanoa and Lalit Kapoor and featuring Shah Rukh Khan, Divya Bharti and Rishi Kapoor in the lead. This was Shah Rukh\'s debut release, and he appears only in the second half of the film. He replaced Armaan Kohli, who walked out of the project due to creative differences after the first schedule. The film released on June 25, 1992. " Dil Aashna Hai" was supposed to be the debut movie of Shahrukh Khan however "Deewana" was released first.', 'title': 'Deewana (1992 film)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Couchville, Tennessee was a community and U.S. Post Office founded on Stones River prior to 1880 in Davidson County, Tennessee. Couchville was inundated when J. Percy Priest Lake was formed by impounding Stones River in the mid-1960s. The community's identity is preserved in the name of adjacent Couchville Cedar Glade State Natural Area.", 'title': 'Couchville, Tennessee'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "The Battle of Stones River or Second Battle of Murfreesboro, was fought from December 31, 1862, to January 2, 1863, in Middle Tennessee, as the culmination of the Stones River Campaign in the Western Theater of the American Civil War. Of the major battles of the Civil War, Stones River had the highest percentage of casualties on both sides. Although the battle itself was inconclusive, the Union Army's repulse of two Confederate attacks and the subsequent Confederate withdrawal were a much-needed boost to Union morale after the defeat at the Battle of Fredericksburg, and it dashed Confederate aspirations for control of Middle Tennessee.", 'title': 'Battle of Stones River'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Stones River National Battlefield, a 570 acre park along the Stones River in Rutherford County, Tennessee, three miles (5\xa0km) northwest of Murfreesboro and twenty-eight miles southeast of Nashville, memorializes the Battle of Stones River, a key battle of the American Civil War that took place on December 31, 1862 and January 2, 1863, which resulted in a strategic Union victory.', 'title': 'Stones River National Battlefield'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Stones River Greenway Arboretum is an arboretum located along the Stones River Greenway, beside the Stones River, in Murfreesboro, Tennessee.', 'title': 'Stones River Greenway Arboretum'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Grindstone River is a 6.7 mi river of Minnesota, a tributary of the Kettle River. Its name is derived either from the Dakota "Iŋswú watpá" (Small Stones River) or from the Ojibwe "Zhiigwanaabikokaa-ziibi" (River abundant with grind stones). Sandstone taken from near the river was used to produce sharpening stones. In Ojibwe, Hinckley ("Gaa-zhiigwanaabikokaag") is named after this river.', 'title': 'Grindstone River'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Frederick Phisterer (October 11, 1836 – July 13, 1909) was an American soldier who fought in the American Civil War. Phisterer received his country's highest award for bravery during combat, the Medal of Honor. Phisterer's medal was won for actions at the Battle of Stones River at Murfreesboro, Tennessee, now marked by the Stones River National Battlefield. He was honored with the award on December 12, 1894.", 'title': 'Frederick Phisterer'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The following Union Army units and commanders fought in the Battle of Stones River of the American Civil War. The Confederate order of battle is listed separately. Order of battle compiled from the army organization during the campaign, the casualty returns and the reports.', 'title': 'Stones River Union order of battle'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "The Battle of Saipan was a battle of the Pacific campaign of World War II, fought on the island of Saipan in the Mariana Islands from 15 June to 9 July 1944. The Allied invasion fleet embarking the expeditionary forces left Pearl Harbor on 5 June 1944, the day before Operation Overlord in Europe was launched. The U.S. 2nd Marine Division, 4th Marine Division, and the Army's 27th Infantry Division, commanded by Lieutenant General Holland Smith, defeated the 43rd Infantry Division of the Imperial Japanese Army, commanded by Lieutenant General Yoshitsugu Saito.", 'title': 'Battle of Saipan'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Paysonia stonensis (syn. "Lesquerella stonensis") is a species of flowering plant in the mustard family, known by the common name Stones River bladderpod. It is endemic to Tennessee in the United States, where it is limited to Rutherford County. It grows only in the floodplains of the Stones River, and certain tributaries.', 'title': 'Paysonia stonensis'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Stones River Campaign of the American Civil War lasted from November 1862 to January 1863. The campaign was tactically a draw but was a strategic Union victory due to the Confederate retreat after the Battle of Stones River.', 'title': 'Stones River Campaign'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Beautiful Mess" is a song written by Shane Minor, Clay Mills and former Exile member Sonny LeMaire, and recorded by American country music group Diamond Rio. It was released in April 2002 as the first single from Diamond Rio\'s album "Completely". The song reached Number One on the "Billboard" Hot Country Singles & Tracks (now Hot Country Songs) charts, a position that it held for two non-consecutive weeks. The song was also Diamond Rio\'s most successful crossover single, peaking at number 28 on the US "Billboard" Hot 100.', 'title': 'Beautiful Mess (song)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'James Andrew House (born March 22, 1955) is an American country music artist. Originally a member of a group called the House Band, he recorded a solo rock album in 1983 on Atlantic Records before he began his country music career in 1989 on MCA Records, recording two albums for that label. He later penned singles for Diamond Rio and Dwight Yoakam, before finding another record deal on Epic Records in 1994. That year, he charted two Top 40 singles on the "Billboard" country chart, including the Top ten hit "This Is Me Missing You". He has also written singles for Diamond Rio, Dwight Yoakam, and Martina McBride.', 'title': 'James House (singer)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Bunmi Koko was a Luxury Fashion Brand, based in London, England. Creative Director Bunmi Olaye and partner Francis Udom founded Bunmi Koko in 2009. The name was inspired by the designer’s first name ‘Bunmi’ (which means \'God gave me\') and the nickname given to her by her partner Francis; "Koko" (meaning my other half’). The two phrases joined to mean, "God gave me my other half."', 'title': 'Bunmi Koko'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Diamond Rio is the eponymous first studio album of the country music band Diamond Rio. Released in 1991 on Arista Records, it produced five chart singles on the "Billboard" country music charts: the Number One hit "Meet in the Middle", as well as the Top Ten hits "Mirror, Mirror", "Mama Don\'t Forget to Pray for Me", "Norma Jean Riley" and "Nowhere Bound". The album itself received RIAA platinum certification.', 'title': 'Diamond Rio (album)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Diamond Rio is an American country music band founded in 1982. Their discography consists of Ten studio albums, 36 singles, four compilation albums, and 20 music videos. Founded in 1984, Diamond Rio released their self-titled debut album in 1991. " Meet in the Middle", the lead-off single, reached #1 on the "Billboard" country singles chart, making Diamond Rio the first country group in history to have their debut single reach that position.', 'title': 'Diamond Rio discography'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"Meet in the Middle" is a song recorded by American country music band Diamond Rio. It was released in February 1991 as their debut single, and was served as the first single from the album "Diamond Rio". The single reached Number One on the U.S. "Billboard" Hot Country Singles & Tracks charts, making Diamond Rio the first country music band in history to have its debut single reach Number One. The song was written by Don Pfrimmer, Chapin Hartford and Jim Foster.', 'title': 'Meet in the Middle'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"I Believe" is a song written by Skip Ewing and Donny Kees, and recorded by American country music band Diamond Rio. It was released in November 2002 as the second single from their album "Completely". The song became Diamond Rio\'s fifth and final No. 1 single on the "Billboard" Country Songs chart in 2003.', 'title': 'I Believe (Diamond Rio song)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': '"Imagine That\'" is a song written by Bryan White, Derek George and John Tirro, and recorded by American country music group Diamond Rio. It was released in November 1997 as the second and final single from their "Greatest Hits" collection. It peaked at number 4 in both the United States and Canada.', 'title': 'Imagine That (Diamond Rio song)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'In Deep, released in 1973, is the 4th studio album by Argent; originally released by Epic Records, KE 32195. It features the original full-length recording of "God Gave Rock and Roll to You", which reached No.18 in the UK charts (U.S. #114); when released as a single in edited form later the same year. It was later remade by Kiss as "God Gave Rock \'n\' Roll to You II" for the film "Bill & Ted\'s Bogus Journey" in 1991, when it was a massive worldwide hit.', 'title': 'In Deep (Argent album)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Bryan Shelton White (born February 17, 1974) is an American country music artist. Signed to Asylum Records in 1994 at age 20, White released his self-titled debut album that year. Both it and its follow-up, 1996\'s "Between Now and Forever", were certified platinum by the Recording Industry Association of America, and 1997\'s "The Right Place" was certified gold. His fourth album, 1999\'s "How Lucky I Am", produced 2 top 40 singles, with the song "God Gave Me You" eventually becoming a big hit in the Philippines.', 'title': 'Bryan White'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Roots: The Saga of an American Family is a novel written by Alex Haley and first published in 1976. It tells the story of Kunta Kinte, an 18th-century African, captured as an adolescent and sold into slavery in the United States, and later follows his life and the lives of his descendants in the United States down to Haley. The release of the novel, combined with its hugely popular television adaptation, "Roots" (1977), led to a cultural sensation in the United States, and it is considered to be one of the most important U.S. works of the 20th century. The novel spent months on "The New York Times" Best Seller List, including 22 weeks in the top spot on that list. The last seven chapters of the novel were later adapted in the form of a second miniseries, "" (1979). It stimulated interest in genealogy and appreciation for African-American history.', 'title': 'Roots: The Saga of an American Family'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Mama Flora's Family is a 1997 historical fiction novel by Alex Haley and David Stevens. The story spans from the 1920s to the 1970s as it follows Flora, a daughter of poor black Mississippi sharecroppers, and her descendants. Haley died before completing the novel, with Stevens finishing the story line.", 'title': "Mama Flora's Family"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Alex Pascall, OBE, is a Grenada-born broadcaster, journalist, musician, composer, oral historian and educator. Based in Britain for over 50 years, he was one of the developers of the Notting Hill Carnival, is a political campaigner and was part of the team behind the birth of Britain\'s first national black newspaper "The Voice". Credited with having "established a black presence in the British media", Pascall is most notable as having been one of the first regular Black radio voices in the UK, presenting the programme "Black Londoners" on BBC Radio London for 14 years from 1974. Initially planned as a test series of six programmes, "Black Londoners" became, in 1978, the first black daily radio show in British history, with prominent guests from the worlds of politics, sport, literature and the arts, including Muhammad Ali, Alex Haley and the Mighty Sparrow.', 'title': 'Alex Pascall'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'George Williford Boyce Haley (August 28, 1925 – May 13, 2015) was an American attorney, diplomat and policy expert having served under seven presidential administrations. He was one of two younger brothers to the Pulitzer Prize winner Alex Haley.', 'title': 'George W. Haley'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Roots: The Next Generations is an American television miniseries, introduced in 1979, continuing, from 1882 to the 1960s, the fictionalized story of the family of Alex Haley and their life in Henning, Lauderdale County, Tennessee, USA. (Henning is about 48 miles north of Memphis, which is on the Mississippi River and in the southwest corner of the state, and which was then the largest city in it.) This sequel to the 1977 miniseries is based on the last seven chapters of Haley\'s novel entitled "" plus additional material by Haley.', 'title': 'Roots: The Next Generations'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Kunta Kinte ( 1750 – 1822; ) is a character in the novel "" by American author Alex Haley. Haley claimed that Kunta Kinte was based on one of his ancestors: a Gambian man who was born in 1750, enslaved and taken to America and who died in 1822. Haley said that his account of Kunta\'s life in "Roots" was a mixture of fact and fiction. The extent to which Kunta Kinte is based on fact is disputed.', 'title': 'Kunta Kinte'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Alex Haley\'s Queen (also known as Queen) is a 1993 American television miniseries that aired in three installments on February 14, 16, and 18 on CBS. The miniseries is an adaptation of the novel "", by Alex Haley and David Stevens. The novel is based on the life of Queen Jackson Haley, Haley\'s paternal grandmother. Alex Haley died in February 1992 before completing the novel. It was later finished by David Stevens and published in 1993. Stevens also wrote the screenplay for the miniseries.', 'title': "Alex Haley's Queen"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Alex Haley House and Museum State Historic Site is one of the Tennessee Historical Commission's state-owned historic sites and is located in Henning, Tennessee, United States. It is open to the public and partially funded by an agreement with the Tennessee Historical Commission. It was originally known as W. E. Palmer House and was the boyhood home of author Alex Haley. He was buried on the grounds. The home was listed on the National Register of Historic Places in 1978. In 2010, the site debuted the state-funded Alex Haley Museum and Interpretive Center which features a museum and interpretive center (designed by architect Louis Pounders) with exhibitions covering Haley's life.", 'title': 'Alex Haley House and Museum'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Simon Alexander Haley (March 8, 1892 – August 19, 1973) was a professor of agriculture, and father of writer Alex Haley. He was born in Savannah, Tennessee, to farmer Alexander "Alec" Haley and his wife Queen (Davy) Haley (née Jackson). Both his parents were born as slaves, and both apparently fathered by white slave owners. Simon attended Lane College in Jackson, Tennessee, at age 15. After enlisting in the military during World War I, he married Bertha George Palmer, also a student from Lane. Simon then finished his master\'s degree in agriculture at Cornell University. Bertha died in 1932, and Simon was remarried two years later to professor Zeona Hatcher. Simon Haley held positions at various southern universities including Alabama A&M just north of Huntsville, Alabama. He was buried at Little Rock National Cemetery in Little Rock, Arkansas.', 'title': 'Simon Haley'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Autobiography of Malcolm X was published in 1965, the result of a collaboration between human rights activist Malcolm\xa0X and journalist Alex Haley. Haley coauthored the autobiography based on a series of in-depth interviews he conducted between 1963 and Malcolm\xa0X\'s 1965 assassination. The "Autobiography" is a spiritual conversion narrative that outlines Malcolm\xa0X\'s philosophy of black pride, black nationalism, and pan-Africanism. After the leader was killed, Haley wrote the book\'s epilogue. He described their collaborative process and the events at the end of Malcolm\xa0X\'s life.', 'title': 'The Autobiography of Malcolm X'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Kellyn Lillian Plasschaert (November 26, 1958–April 30, 2009) was an American actress born in Los Angeles, California and the daughter of Alex Edward Plasschaert, a stuntman and choreographer. She was the hostess of the children\'s television series "Mousercise". Her residence was in Canyon Country, California. Kellyn died from cancer on April 30, 2009. She was cremated.', 'title': 'Kellyn Plasschaert'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Irene Gorovaia (Russian: Ирина Горовая ; born June 13, 1989), also credited as Irina Gorovaia, is an American actress born in Russia and raised in Brooklyn, New York. She has been a ballet dancer for many years, training with the School of American Ballet.', 'title': 'Irene Gorovaia'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Jennifer Grey (born March 26, 1960) is an American actress. She is known for her roles in the 1980s films "Ferris Bueller\'s Day Off" (1986) and "Dirty Dancing" (1987), for which Grey earned a Golden Globe Award nomination. She is also known for her 2010 victory in season eleven of "Dancing with the Stars". Grey is the daughter of Academy Award–winning actor Joel Grey and former actress/singer Jo Wilder, Grey currently stars in the Amazon Studios comedy series "Red Oaks".', 'title': 'Jennifer Grey'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Jean Fenwick, born Harriet Krauth (May 30, 1907 — December 5, 1998) was an American actress born in Trinidad.', 'title': 'Jean Fenwick'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Renée Lee Moniz (born October 16, 1977) is an American actress born and raised in Rhode Island. She is also known as "Renée Moniz" and "Renee Bourque Moniz". She has appeared in "American Hustle" and in the movie "27 Dresses" where she plays Katherine Heigl\'s co-worker at Urban Everest.', 'title': 'Renée Bourque'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Jacqueline Lovell (born 9 December 1974) is an American actress born and raised in Southern California. Most of her roles have been in B-films and erotic movies.', 'title': 'Jacqueline Lovell'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Wind is a 1992 film. The movie was directed by Carroll Ballard and starred Matthew Modine, Jennifer Grey and Cliff Robertson.', 'title': 'Wind (film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Soad Hosny (Arabic: سعاد حسنى\u200e \u200e \xa0] : January 26, 1943 – June 21, 2001) was an Egyptian actress born in Cairo. She was known as the "Cinderella of Egyptian cinema" and one of the most influential actresses in the Middle East and the Arab world. She ascended to stardom at the end of the 1950s, performing in more than 83 films between 1959 and 1991. A majority of her films were shot in the 1960s and 1970s. Her final screen appearance was in the 1991 film, "The Shepherd and the Women", directed by her ex-husband, Ali Badrakhan.', 'title': 'Soad Hosny'}
