[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Poison Ivy" is a popular song by American songwriting duo Jerry Leiber and Mike Stoller. It was originally recorded by The Coasters in 1959. It went to #1 on the R&B chart, #7 on the "Billboard" Hot 100 chart, and #15 in the UK. This was their third top-ten hit of that year following "Charlie Brown" and "Along Came Jones".', 'title': 'Poison Ivy (song)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Selda and Derek are an American songwriting duo, consisting of Selda Sahin (lyrics) and Derek Gregor (music), best known as the songwriters of the musical film Grind, starring Anthony Rapp, Claire Coffee and Pasha Pellosie. They are co-writing Eric Michael Krop\'s pop album "Greater Things", to be released in 2016.', 'title': 'Selda and Derek'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Benj Pasek and Justin Paul, known together as Pasek and Paul, are an American songwriting duo and composing team for musical theater, films, and television. Their works include "", "Dogfight", "Edges", "Dear Evan Hansen", and "James and the Giant Peach". Their original songs have been featured on NBC\'s "Smash", and in the film "La La Land", for which they won both the Golden Globe and Academy Award for Best Original Song for the song "City of Stars".', 'title': 'Pasek and Paul'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': '"Rewrite This Story" is an original song introduced in the seventh episode of the second season of the musical TV series Smash, entitled "Musical Chairs". It was written by Pasek and Paul, but within the show\'s universe, it was written by songwriting team Jimmy Collins (Jeremy Jordan) and Kyle Bishop (Andy Mientus) for their "Hit List" musical.', 'title': 'Rewrite This Story'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Charles Gilbert, Jr. is a writer, composer, director and educator who specializes in musical theater. Currently a Professor of Theater Arts in the Ira Brind School of Theater Arts at the University of the Arts in Philadelphia, Gilbert served as Director of the Brind School from 2008 to 2013 after heading its Musical Theater Program for nearly twenty years. He developed the SAVI System of Singing-Acting and has taught students using this pedagogy in workshops and residencies in the United Kingdom, Sweden, Denmark and Germany. Among his works for the musical stage is the 1979 musical "Assassins". , source of the idea for Stephen Sondheim\'s Tony Award-winning musical of the same name.', 'title': 'Charles Gilbert, Jr.'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Carner and Gregor are an American musical theatre songwriting duo consisting of Sam Carner and Derek Gregor. They are the recipients of a 2004 Richard Rodgers Award for Musical Theater from the American Academy of Arts and Letters for their musical "Unlock\'d". The team has collaborated since 2002, with Carner working as the lyricist and Gregor as the composer. They reside and work in New York City.', 'title': 'Carner and Gregor'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Sherman Brothers were an American songwriting duo that specialized in musical films, made up of Robert B. Sherman (December 19, 1925 – March 6, 2012) and Richard M. Sherman (born June 12, 1928).', 'title': 'Sherman Brothers'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Livingston and Evans were the songwriting and composing team of Jay Livingston (1915-2001) and Ray Evans (1915-2007), who worked on movies, television and stage.', 'title': 'Livingston &amp; Evans'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Pastafazoola (also known as Pastafazula) is a 1927 novelty song written by the early 20th-century American songwriting duo of Van and Schenck. Borrowing heavily from the Italian standard "Funiculì, Funiculà", the song tells of the masterful feats of world-leading individuals who ate the traditional Italian dish, "pasta fagioli", which is simple "peasant fare" of pasta and navy beans. Among the individuals mentioned in the song are Babe Ruth, who had hit a record 60 home runs during the 1927 season, singer John McCormack, John D. Rockefeller, Jack Dempsey, Charles Lindbergh, Christopher Columbus and Benito Mussolini.', 'title': 'Pastafazoola'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Marian Hill is an American songwriting duo from Philadelphia consisting of production artist Jeremy Lloyd and vocalist Samantha Gongol. Their name comes from two characters, Marian Paroo and Harold Hill, from the musical "The Music Man".', 'title': 'Marian Hill'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Robert John Kirby (October 20, 1889 – January 15, 1944) was the Warden of Sing Sing prison from 1941 until 1944. Highly regarded for his integrity, Kirby brought respect back to the administration of Sing Sing, and order to the prison after the often controversial tenure of Lewis Lawes.', 'title': 'Robert J. Kirby'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Bulgarian dvoyanka is a double flute made of a single piece of wood, with six sound holes on one side. It is most frequently made of ash-wood, plum tree, pear tree, cornel or boxwood. The tune is played on the right pipe, while the left pipe provides a flat tone (or drone) as accompaniment. The playing structure on the right pipe is similar to that of the music played on the kaval. The dvoyanka has traditionally been an instrument favored by shepherds. Line-dances and lively melodies are frequently played on it. It is a known fact that shepherds directed their flocks by their playing, since sheep remember and recognize a melody in time. A shepherd could "teach" his flock to start from the pen towards the pasture at one melody, and to return to the village in the evening at another. The instrument bears similitudes to the dvojnica, an instrument typical for the regions of Central and Western Serbia and Serbian regions across the river Drina, which is made and played somewhat differently.', 'title': 'Dvoyanka'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"In the Hall of the Mountain King" (Norwegian: "I Dovregubbens hall" ) is a piece of orchestral music composed by Edvard Grieg in 1875 as incidental music for the sixth scene of act 2 in Henrik Ibsen\'s 1867 play "Peer Gynt". It was originally part of Opus 23 but was later extracted as the final piece of "Peer Gynt", Suite No. 1, Op. 46. Its easily recognizable theme has helped it attain iconic status in popular culture, where it has been arranged by many artists (See Grieg\'s music in popular culture).', 'title': 'In the Hall of the Mountain King'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Damage" is a song by American hip hop artist Pharoahe Monch, released as the lead single from his fourth studio album, "P.T.S.D. (Post Traumatic Stress Disorder)". Prior to its release date, Pharoahe Monch\'s independent label, W.A.R. Media, published a visual trailer to YouTube on September 22, 2012. The song was officially made available for purchase worldwide on September 27, 2012, on the iTunes Music Store by W.A.R. Media in conjunction with Duck Down Music Inc.. The Lee Stone-produced song is the final piece to Pharoahe\'s "bullet" trilogy in which he anthropomorphizes a slug fired with the intent to annihilate, and tackles the issue of gun violence. The song and its provide a chilling reminder that bullets have no name.', 'title': 'Damage (Pharoahe Monch song)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Runaway is the third album from London indie-rock band The Magic Numbers. The Stodart and Gannon siblings reveal a rather upbeat side on this offering, compared to their 2006 release "Those the Brokes". The album features string arrangements by Robert Kirby (Nick Drake, Elvis Costello), who died in 2009, with "The Runaway" ultimately proving to be his final piece of work.', 'title': 'The Runaway (album)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'John Kirby (December 31, 1908 – June 14, 1952), was a jazz double-bassist who also played trombone and tuba. In addition to sideman work (prominently with Benny Goodman), Kirby is remembered for leading a successful chamber jazz sextet in the late 1930s and early 1940s, which scored several hit songs including "Loch Lomond" and the debut recording of "Undecided", a jazz standard.', 'title': 'John Kirby (musician)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': '"The Bonnie Banks o\' Loch Lomond", or simply "Loch Lomond" for short, is a well-known traditional Scottish song (Roud No. 9598) first published in 1841 in "Vocal Melodies of Scotland". The song prominently features Loch Lomond, the largest Scottish loch, located between the counties of Dunbartonshire and Stirlingshire. In Scotland, the song is often the final piece of music played during an evening of revelry (a dance party or dinner, etc.).', 'title': "The Bonnie Banks o' Loch Lomond"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'A keystone (also known as capstone) is the wedge-shaped stone piece at the apex of a masonry arch, or the generally round one at the apex of a vault. In both cases it is the final piece placed during construction and locks all the stones into position, allowing the arch or vault to bear weight. In both arches and vaults, keystones are often enlarged beyond the structural requirements, and often decorated in some way. Keystones are often placed in the centre of the flat top of openings such as doors and windows, essentially for decorative effect.', 'title': 'Keystone (architecture)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The American Ruling Class is a 2005 dramatic documentary film written by Lewis H. Lapham and directed by John Kirby that "explores our country’s most taboo topic: class, power and privilege in our nominally democratic republic." It seeks to answer the question, "Does America have a ruling class?" Its producers consider it the first "dramatic-documentary-musical." A rough-cut of the film was shown at the 2005 Tribeca Film Festival, the final version of the film was shown on the Sundance Channel in July 2007, and it had its theatrical premiere at the Brooklyn Academy of Music in April 2008.', 'title': 'The American Ruling Class'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Peşrev (pronounced ] in Turkish), "Pişrev" ([piʃˈɾev] ), "peshrev," or "pishrev;" called "bashraf" بشرف in Arabic; is an instrumental form in Turkish classical music. It is the name of the first piece of music played during a group performance called a fasıl (] ). It also serves as the penultimate piece of the "Mevlevi ayini", ritual music of the Mevlevi order, under the name "son peşrev" (final peşrev), preceding "son semai". It usually uses long rhythm cycles, stretching over many measures as opposed to the simpler usul the other major form of instrumental music uses, "saz semai".', 'title': 'Peşrev'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Come Fly with Me" is the third episode of the first season of the ABC sitcom "Modern Family" and the third episode of the series overall. It originally aired on October 7, 2009. The episode was written by Dan O\'Shannon and directed by Reginald Hudlin.', 'title': 'Come Fly with Me (Modern Family)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"The Devil In the Dark" is the third episode of the first season of the American science fiction series "Defiance", and the series\' third episode overall. It was aired on April 29, 2013. The episode was written by Michael Taylor and it was directed by Omar Madha.', 'title': 'The Devil In the Dark'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Homer\'s Odyssey" is the third episode of the first season of "The Simpsons". It originally aired on the Fox network in the United States on January 21, 1990. In this episode, Homer becomes a crusader for citizen safety in Springfield, and is promoted to his current position as Nuclear Safety Inspector for the entire power plant. It was written by Jay Kogen and Wallace Wolodarsky and was the first "Simpsons" script to be completed, although it was the third episode produced.', 'title': "Homer's Odyssey (The Simpsons)"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Queens for a Day" is the third episode in the American dramedy series "Ugly Betty", which aired on October 12, 2006. Although this is the third episode overall in the series, it is listed as the second episode on the first season DVD release, while "The Box and the Bunny" was listed as episode 3.', 'title': 'Queens for a Day'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Health Care" is the third episode of the first season of the American comedy television series "The Office", and the show\'s third episode overall. Written by Paul Lieberstein, who also acts in the show as Toby Flenderson, and directed by Ken Whittingham, the episode first aired in the United States on April 5, 2005 on NBC.', 'title': 'Health Care (The Office)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Orange Is the New Black (sometimes abbreviated to OITNB) is an American comedy-drama web television series created by Jenji Kohan for Netflix. The series is based on Piper Kerman\'s memoir, "" (2010), about her experiences at FCI Danbury, a minimum-security federal prison. "Orange Is the New Black" premiered on July 11, 2013 on the streaming service Netflix. In February 2016, the series was renewed for a fifth, sixth, and seventh season. The fifth season was released on June 9, 2017. The series is produced by Tilted Productions in association with Lionsgate Television.', 'title': 'Orange Is the New Black'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Power Rangers Ninja Storm is an American television series and the eleventh season of the "Power Rangers" franchise, based on the Super Sentai series "Ninpuu Sentai Hurricaneger". This is the first season to be filmed in New Zealand and also the second season to be under the BVS copyright. This is the first season not produced by MMPR Productions. This series is unique in the fact that it was the first to feature only one female Ranger serving on the team (although the 10-episode mini-series Alien Rangers featured only one female Ranger), the first season to not have an African American Ranger, the first season where the Blue Ranger was female, the second, (first full) season where the Yellow Ranger was male and was the first season to begin the series with three Rangers instead of five like the previous seasons, and also the first and only season to have a crimson and navy ranger. This was the first series to air on ABC in its entirety. It was also the last series to premiere episodes first on ABC Kids until "Power Rangers RPM". ABC Family had encore reruns following their premiere. This season did not have a Power Rangers team up episode like the five before it due to a shift back to non-SAG talent when production was moved to New Zealand from Los Angeles. This is the third series to air under Saban Brands on Nicktoons, which began on June 1, 2012.', 'title': 'Power Rangers Ninja Storm'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Friday Night Bites" is the third episode of the first season of The CW television series, "The Vampire Diaries" and the third episode of the series overall. It originally aired on Thursday, September 24, 2009. The episode was written by Barbie Kligman and Bryan M. Holdman and directed by John Dahl.', 'title': 'Friday Night Bites'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': '"Lesbian Request Denied" is the third episode of the first season of American comedy-drama series "Orange Is the New Black" ("OITNB"), based on Piper Kerman\'s memoir, "" (2010), regarding her time at FCI Danbury, a minimum-security federal prison. It was written by Sian Heder, and is one of two "OITNB" episodes directed by award-winning actress and director Jodie Foster. The episode was originally released, simultaneously with twelve other episodes making up the first season, on American streaming service Netflix on July 11, 2013.', 'title': 'Lesbian Request Denied'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"The Box and the Bunny" is the second episode from the American dramedy series "Ugly Betty", which aired on October 5, 2006. Although this is the second episode overall in the series, it is listed as the third episode on the first season DVD release, while "Queens for a Day" was listed as episode 2. The episode\'s title is a reference to the music box that Bradford took from Fey\'s apartment, and Betty\'s pink bunny that Amanda kidnaps and abuses. It is also the first episode to be produced in Los Angeles.', 'title': 'The Box and the Bunny'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Visions fugitives, Op. 22, are a series of short piano pieces composed by Russian composer Sergei Prokofiev (1891–1953) between 1915 and 1917. They were premiered by Prokofiev on April 15, 1918 in Petrograd, Soviet Union. They were written individually, many for specific friends of Prokofiev\'s, and he originally referred to them as his "doggies" because of their "bite". In August 1917, Prokofiev played them for Russian poet Konstantin Balmont, and others, at the home of a mutual friend. Balmont was inspired to compose a sonnet on the spot, called "a magnificent improvisation" by Prokofiev who named the pieces ""Mimolyotnosti"" from these lines in Balmont\'s poem: ""In every fleeting vision I see worlds, Filled with the fickle play of rainbows"". A French-speaking friend at the house, Kira Nikolayevna, immediately provided a French translation for the pieces: "Visions Fugitives". Prokofiev often performed only a couple of them at a time as encores at the end of his performances.', 'title': 'Visions fugitives'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Sergei Olegovich Prokofieff (16 January 1954 – 26 July 2014) was a Russian anthroposophist. He was the grandson of the composer Sergei Prokofiev and his first wife Lina Prokofiev, and the son of Oleg Prokofiev and his first wife Sofia Korovina. Born in Moscow, he studied fine arts and painting at the Moscow School of Art. He encountered anthroposophy in his youth, and soon made the decision to devote his life to it.', 'title': 'Sergei O. Prokofieff'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Sergei Prokofiev\'s String Quartet No. 2 in F Major, Op. 92 (1941) was first performed by the Beethoven Quartet in Moscow on 7 April 1942. A later concert in Moscow, on 5 September 1942, was delayed by a Nazi air raid and started late. Prokofiev thought it "an extremely turbulent success." The string quartet, lasting for 20–25 minutes, is in three movements.', 'title': 'String Quartet No. 2 (Prokofiev)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Semyon Kotko (Russian: Семён Котко ), Op. 81, is an opera in five acts by Sergei Prokofiev to a libretto by Sergei Prokofiev and Valentin Katayev based on Katayev\'s 1937 novel "I, Son of Working People" (Russian: Я, сын трудового народа… ). It was premiered on 23 June 1940 at the Stanislavsky Opera Theatre in Moscow.', 'title': 'Semyon Kotko'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Flute Sonata in D, Op. 94, was completed in the summer of 1943 by Sergei Prokofiev. At that same time, Prokofiev was working on music for "Ivan the terrible". The flute sonata in D was first performed in Moscow, Russia on December 7, 1943 by Nicolai Kharkovsky (flute) and Sviatoslav Richter (piano). It was later transcribed for violin in 1944, by the composer with the help of violinist David Oistrakh, as Op. 94a. The violin version was first performed by David Oistrakh (violin) and Lev Oborin, Piano, on June 17, 1944.', 'title': 'Flute Sonata (Prokofiev)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The Love for Three Oranges, Op. 33, also known by its French language title L\'amour des trois oranges (Russian: Любовь к трём апельсинам , "Lyubov\' k tryom apel\'sinam"), is a satirical opera by Sergei Prokofiev. Its French libretto was based on the Italian play "L\'amore delle tre melarance" by Carlo Gozzi. The opera premiered at the Auditorium Theatre in Chicago, Illinois, on 30 December 1921.', 'title': 'The Love for Three Oranges'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Sergei Prokofiev set to work on his Piano Concerto No. 2 in G minor, Op. 16, in 1912 and completed it in 1913. But this concerto is lost; the score was destroyed in a fire following the Russian Revolution. Prokofiev reconstructed the work in 1923, two years after finishing his Third Concerto, and declared it to be “so completely rewritten that it might almost be considered [Concerto] No. 4”; indeed its orchestration has features that clearly postdate the 1921 concerto. Performing as solo pianist, Prokofiev premiered this surviving “No. 2” in Paris on 8 May 1924 with Serge Koussevitzky conducting. It is dedicated to the memory of Maximilian Schmidthof, a friend of Prokofiev's at the St. Petersburg Conservatory who had killed himself in 1913.", 'title': 'Piano Concerto No. 2 (Prokofiev)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Sergei Prokofiev's Trapèze Ballet is scored for oboe, clarinet, violin, viola and double bass. The ballet, closely related to Prokofiev's Quintet, Op. 39 (1924), contains eight movements (in five parts) and lasts 20–25 minutes. The complete ballet in eight movements was first performed in Gotha, a small German town near Hanover, on 6 November 1925.", 'title': 'Trapeze (Prokofiev)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Sergei Prokofiev\'s Lieutenant Kijé (Russian: Поручик Киже , "Poruchik Kizhe") music was originally written to accompany the film of the same name, produced by the Belgoskino film studios in Leningrad in 1933–34 and released in March 1934. It was Prokofiev\'s first attempt at film music, and his first commission from within the Soviet Union; he had lived abroad since the 1917 October Revolution. After the film\'s release, Prokofiev adapted the music into what became a popular orchestral suite, his Op. 60.', 'title': 'Lieutenant Kijé (Prokofiev)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Sergei Sergeyevich Prokofiev ( ; Russian: Сергей Сергеевич Прокофьев , "Sergej Sergejevič Prokofjev" ; 27\xa0April 1891\xa0– 5\xa0March 1953) was a Soviet composer, pianist and conductor. As the creator of acknowledged masterpieces across numerous musical genres, he is regarded as one of the major composers of the 20th century. His works include such widely heard works as the March from "The Love for Three Oranges," the suite "Lieutenant Kijé", the ballet "Romeo and Juliet" – from which "Dance of the Knights" is taken – and "Peter and the Wolf." Of the established forms and genres in which he worked, he created – excluding juvenilia – seven completed operas, seven symphonies, eight ballets, five piano concertos, two violin concertos, a cello concerto, a Symphony-Concerto for cello and orchestra, and nine completed piano sonatas.', 'title': 'Sergei Prokofiev'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Dr. Leonard Jan Le Vann (1 August 1915 – 29 September 1987) was the medical superintendent at the Alberta Provincial Training School for Mental Defectives (also known as the Michener Center) from the years 1949–1974. Although he was born and raised in the United States, Le Vann trained as a physician in Scotland. Throughout his career Le Vann wrote many articles, the majority of which were published during his 25-year career at the Provincial Training School. These articles covered a broad range of topics that include alcoholism, schizophrenia and experimental treatments of antipsychotic drugs. In 1974 Le Vann resigned from the training center, which was due to the Conservative Party of Alberta’s repeal against the Sexual Sterilization Act of Alberta. Furthermore, there has been plenty of controversy about how he ran the school. This controversy has been brought to attention mainly because of the Leilani Muir trial that took place in 1995. Although Le Vann was already deceased at the time of the trial, his name was brought to the court’s attention on many separate occasions.', 'title': 'Leonard Jan Le Vann'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Human history in California begins with indigenous Americans first arriving in California some 13,000–15,000 years ago. Exploration and settlement by Europeans along the coasts and in the inland valleys began in the 16th century. California was acquired by the United States under the terms of the 1848 Treaty of Guadalupe Hidalgo following the defeat of Mexico in the Mexican–American War. American westward expansion intensified with the California Gold Rush, beginning in 1849. California joined the Union as a free state in 1850, due to the Compromise of 1850. By the end of the 19th century, California was still largely rural and agricultural, but had a population of about 1.4 million.', 'title': 'History of California before 1900'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Breckland Forest is an 18,126 hectare biological and geological Site of Special Scientific Interest in many separate areas between Swaffham in Norfolk and Bury St Edmunds in Suffolk. It is part of the Breckland Special Protection Area under the European Union Directive on the Conservation of Wild Birds. It contains two Geological Conservation Review sites, Beeches Pit, Icklingham and High Lodge. Barton Mills Valley is a Local Nature Reserve in the south-west corner of the site.', 'title': 'Breckland Forest'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Rollins Air was an airline charter company based in Honduras. It had Lockheed Tristars. In 2011 it was banned from operating in the European Union due to safety concerns. On 24 September 2012, its AOC (Air Operator's Certificate) was revoked and it subsequently expired. On 4 December 2012 (after the AOC expired) the airline was removed from EU list of banned air carriers.", 'title': 'Rollins Air'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Russians in Kyrgyzstan are a minority ethnic group numbering 419,600 individuals according to 2009 Census, representing 9.1% of the total population. Most ethnic Russians migrated to the country during the 20th Century. The Russian population has been declining since the breakup of the Soviet Union due to low fertility rates and emigration.', 'title': 'Russians in Kyrgyzstan'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The 1951 Polish–Soviet territorial exchange or Polish-Soviet border adjustment treaty of 1951 was a border adjustment signed in Moscow between the People's Republic of Poland and the Soviet Union regarding roughly 480 km2 of land, along their mutual border. The exchange was made to the decisive economic benefit of the Soviet Union due to rich deposits of coal given up by Poland; these deposits were discovered well before World War II. Within eight years following the agreement, the Soviets built four large coal mines there with the total mining capacity of 15 million tons annually.", 'title': '1951 Polish–Soviet territorial exchange'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Āne is a large village in Ozolnieki Municipality, Latvia. The village is located on the Lielupe River approximately 38\xa0km from the capital city of Riga and 7\xa0km from city of Jelgava. It is known for the amount of clay that is dug up in local lakes. There is a brick factory, which was very prominent during the Soviet era; since the factory was privatised it still produces bricks albeit on a reduced scale. The town was very well known in the Soviet Union due to this. It is sometimes referred to by locals as "Sarkanais māls" literally meaning "Red clay".', 'title': 'Āne'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Compromise of 1850 was a package of five separate bills passed by the United States Congress in September 1850, which defused a four-year political confrontation between slave and free states on the status of territories acquired during the Mexican–American War (1846–1848). The compromise, drafted by Whig Senator Henry Clay of Kentucky and brokered by Clay and Democratic Senator Stephen Douglas of Illinois, reduced sectional conflict. Controversy arose over the Fugitive Slave provision. The Compromise was greeted with relief, but each side disliked some of its specific provisions:', 'title': 'Compromise of 1850'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Russian avant-garde was a large, influential wave of avant-garde modern art that flourished in the Russian Empire and Soviet Union, approximately from 1890 to 1930—although some have placed its beginning as early as 1850 and its end as late as 1960. The term covers many separate, but inextricably related, art movements that flourished at the time; namely Suprematism, Constructivism, Russian Futurism, Cubo-Futurism, Zaum and Neo-primitivism. Given that many avant-garde artists involved were born or grew up in what is present day Belarus and Ukraine (including Kazimir Malevich, Aleksandra Ekster, Vladimir Tatlin, Wassily Kandinsky, David Burliuk, Alexander Archipenko), some sources also talk about Ukrainian avant-garde.', 'title': 'Russian avant-garde'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Joseph Sokolsky (Bulgarian: Йосиф Соколски , Gabrovo, Ottoman Empire 1786 – died in Kiev, Russian Empire September 30, 1879) was the first senior Eastern Orthodox Bulgarian clergyman who convert to Catholicism, thus becoming a pioneer of the Bulgarian Byzantine Catholic Church. Sokolsky negotiated with Vatican a formal union due to Phanariotes domination over Bulgarian Orthodoxy and gained Catholic recognition 1861 when Pope Pius IX named him Archbishop for the Bulgarians of the Byzantine Rite. He was also accepted in that capacity by the Ottoman Empire.', 'title': 'Joseph Sokolsky'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Mary Poppins Opens the Door is a British children\'s fantasy novel by the Australian-British writer P.L. Travers, the third book and last novel in the "Mary Poppins" series that features the magical English nanny Mary Poppins. It was published in 1943 by Harcourt, Brace & World, Inc and illustrated by Mary Shepard and Agnes Sims.', 'title': 'Mary Poppins Opens the Door'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Mary Poppins is a fictional character and the eponymous protagonist of P. L. Travers\' "Mary Poppins" books and all of their adaptations. A magical English nanny, she blows in on the East Wind and arrives at the Banks home at Number Seventeen Cherry Tree Lane, London, where she is given charge of the Banks children and teaches them valuable lessons with a magical touch. Travers gives Poppins the accent and vocabulary of a real London nanny: cockney base notes overlaid with a strangled gentility.', 'title': 'Mary Poppins (character)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Mary Poppins" is a series of children\'s books written by P.L. Travers.', 'title': 'Mary Poppins (disambiguation)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Mary Poppins, Goodbye (Russian: Мэри Поппинс, до свидания! ; translit. "Meri Poppins, do svidaniya") is a Soviet 1983 two-part musical miniseries (part 1 "Lady Perfection", part 2 "Week ends on Wednesday"), directed by Leonid Kvinikhidze. It is loosely based on Mary Poppins stories by P. L. Travers. The TV series were ordered by the Gosteleradio of USSR and produced by Mosfilm. The official television premiere was on January 8, 1984.', 'title': 'Mary Poppins, Goodbye'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Saving Mr. Banks is a 2013 period drama film directed by John Lee Hancock from a screenplay written by Kelly Marcel and Sue Smith. Centered on the development of the 1964 film "Mary Poppins", the film stars Emma Thompson as author P. L. Travers and Tom Hanks as filmmaker Walt Disney, with supporting performances by Paul Giamatti, Jason Schwartzman, Bradley Whitford, and Colin Farrell. Deriving its title from the father in Travers\' story, "Saving Mr. Banks" depicts the author\'s fortnight-long meetings during 1961 in Los Angeles, during which Disney attempts to obtain the screen rights to her novels.', 'title': 'Saving Mr. Banks'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Pamela Lyndon Travers, OBE ( ; born Helen Lyndon Goff; 9 August 1899 – 23 April 1996) was an Australian-born writer who spent most of her career in England. She is best known for the "Mary Poppins" series of children\'s books, which feature the magical nanny Mary Poppins.', 'title': 'P. L. Travers'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Chim Chim Cher-ee" is a song from "Mary Poppins", the 1964 musical motion picture. It was originally sung by Dick Van Dyke and Julie Andrews, and also is featured in the Cameron Mackintosh/Disney "Mary Poppins" musical. The song can be heard in the "Mary Poppins" scene of The Great Movie Ride at Disney\'s Hollywood Studios and during the "Mary Poppins" segment of "" at Disneyland.', 'title': 'Chim Chim Cher-ee'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Mary Eleanor Jessie Knox née Shepard (25 December 1909 – 4 September 2000) was an English illustrator of children\'s books. She is best known for the "Mary Poppins" stories written by P. L. Travers (1934 to 1988): "Mary Shepard: Putting Mary Poppins in the picture", "The Times" of London titled an obituary article. She used her married name Mary Knox outside the publishing industry.', 'title': 'Mary Shepard'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Mary Poppins is a musical with music and lyrics by the Sherman Brothers, with additional music and lyrics by George Stiles and Anthony Drewe, and a script by Julian Fellowes. The musical is based on the similarly titled Mary Poppins children's books by P. L. Travers and the 1964 Disney film, and is a fusion of various elements from the two.", 'title': 'Mary Poppins (musical)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Mary Poppins is a 1964 American musical-fantasy film directed by Robert Stevenson and produced by Walt Disney, with songs written and composed by the Sherman Brothers. The screenplay is by Bill Walsh and Don DaGradi, loosely based on P. L. Travers\' book series "Mary Poppins". The film, which combines live-action and animation, stars Julie Andrews in the role of Mary Poppins who visits a dysfunctional family in London and employs her unique brand of lifestyle to improve the family\'s dynamic. Dick Van Dyke, David Tomlinson, and Glynis Johns are featured in supporting roles. The film was shot entirely at the Walt Disney Studios in Burbank, California using painted London background scenes.', 'title': 'Mary Poppins (film)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': '"Yeah!" is a song by American singer Usher. He co-wrote the song with Sean Garrett, Patrick J. Que Smith, Robert McDowell, LRoc, Ludacris, Da\'Ron, and Lil Jon. It also features guest vocals from Lil Jon and Ludacris, with the former also producing the song as well as incorporating crunk and R&B—which he coined as crunk&B—in the song\'s production. The song was released as the lead single from Usher\'s fourth studio album "Confessions" (2004) on January 27, 2004, after Usher was told by Arista Records, his label at the time, to record more tracks for the album.', 'title': 'Yeah! (Usher song)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"No One" is a song by American singer and songwriter Alicia Keys from her third studio album, "As I Am" (2007). It was written and produced by Keys, Kerry Brothers Jr., and George M. Harry, and released as the album\'s lead single on September 11, 2007. The song topped the "Billboard" Hot 100 for five consecutive weeks and the Hot R&B/Hip-Hop Songs chart for 10 consecutive weeks, while charting inside the top 10 in most major markets.', 'title': 'No One (Alicia Keys song)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Stay" is a song by UK based pop act Shakespears Sister, released by London Records in January 1992 as the second single from their album "Hormonally Yours". Upon release, the single became a global smash hit becoming the duo\'s first and only No. 1 single in numerous territories, including the UK, where it topped the UK Singles Chart for eight consecutive weeks; the longest UK No. 1 reign for any all-female band, and was the fourth biggest selling single of 1992. The single also held the No. 1 position in band member Siobhan Fahey\'s birthplace, Ireland, for six weeks, and it was a transatlantic hit reaching No. 4 on the "Billboard" Hot 100 in the US.', 'title': 'Stay (Shakespears Sister song)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Stay" is a song recorded by American country music duo Sugarland. It was released in September 2007 as the fourth and final single from their album "Enjoy the Ride" (see 2006 in country music). Overall, the song is the group\'s eighth single to enter the "Billboard" Hot Country Songs charts, where it reached a peak position of #2 for four weeks, stuck behind Taylor Swift\'s "Our Song", and has become their signature song. The music video for "Stay" was ranked #10 on CMT\'s 100 Greatest Videos.', 'title': 'Stay (Sugarland song)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Billy Ray Cyrus is an American country music singer, songwriter, actor and philanthropist, who helped make country music a worldwide phenomenon. He has released 12 studio albums and 44 singles since 1992, and is best known for his number one single "Achy Breaky Heart", which became the first single ever to achieve triple Platinum status in Australia and was the best-selling single of 1992 in the same country. Thanks to the video of the song, the linedance entered the mainstream, becoming a worldwide craze. Cyrus, a multi-platinum selling recording artist, has scored a total of eight top-ten singles on the Billboard Country Songs chart. His most successful album to date is the debut of "Some Gave All", which has been certified 9× multi-platinum in the United States and is the longest time spent by a debut artist at number one on the "Billboard" 200 (17 consecutive weeks) and most consecutive chart-topping weeks in the SoundScan era. It is the only album (from any genre) in the SoundScan era to log 17 consecutive weeks at number one and is also the second-highest selling debut album by a male country artist after Garth Brooks\'. It ranked 43 weeks in the top 10, a total topped by only one country album in history, "Ropin\' the Wind" by Garth Brooks. "Some Gave All" was also the first debut album to enter at the number 1 in the Billboard Country Albums. The album has also sold more than 20 million copies worldwide and is the best-selling debut album of all time for a solo male artist. " Some Gave All" was also the best-selling album of 1992 in the US with 4,832,000 copies. In his career, he has released 35 charted singles, of which 16 have charted in the top 40.', 'title': 'Billy Ray Cyrus discography'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Broadway cast recording of the musical My Fair Lady was released as an album on April 2, 1956. The songs were composed by Frederick Loewe with lyrics by Alan Jay Lerner and conducted by Franz Allers, while the cast included stars Julie Andrews and Rex Harrison. The album became a massive seller, topping the charts on the US "Billboard" 200 for fifteen weeks at different times in 1956 (eight consecutive weeks), 1957, 1958 and 1959. In the UK, upon its release in 1958, the album reached No.1 for 19 consecutive weeks and became the biggest-selling album of the year. The album was released on Columbia Records, whose President, Goddard Lieberson provided the $375,000 needed to stage the show in return for the rights to the Cast recording. The album was later re-issued on Compact disc in 1988 and has been re-released a number of times since. It is currently available with bonus tracks.', 'title': 'My Fair Lady (Broadway cast recording)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Can\'t Touch It" is a song by Australian singer and songwriter Ricki-Lee Coulter. It was written by Coulter with Brian Kierulf and Joshua\xa0M.\xa0Schwartz of KNS Productions, who also produced the song. "Can\'t Touch It" was released as the lead single from Coulter\'s second studio album "Brand New Day" on 4 August 2007. Upon its release, "Can\'t Touch It" peaked at number two on the ARIA Singles Chart and number one on the ARIA Dance Singles Chart, where it remained for eight consecutive weeks. It was certified platinum by the Australian Recording Industry Association for shipments of 70,000 copies.', 'title': "Can't Touch It"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Feel Good Inc" is a song by British virtual band Gorillaz, featuring De La Soul. The song was released as the lead single from the band\'s second studio album "Demon Days" on 9 May 2005. The single peaked at No.\xa02 in the United Kingdom and No.\xa014 in the United States. It also topped the Hot Modern Rock Tracks chart in the U.S. for eight consecutive weeks, a first for the band. This is the only song in Damon Albarn\'s career to reach the top 40 on the "Billboard" Hot 100. It peaked in the top 10 in 17 countries, reaching No.\xa01 in Spain. The song was listed in Pitchfork Media and Rolling Stone\'s Best Songs of the 2000s. The song won Best Pop Collaboration at the 2006 Grammy Awards. This song has surpassed "Clint Eastwood" to be Gorillaz\'s most successful single worldwide. Popdose ranked it 26th on their list of 100 best songs of the decade.', 'title': 'Feel Good Inc.'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': '"I Don\'t Wanna Know" is a song by American R&B artist Mario Winans, featuring a rap by P. Diddy, re-recorded background vocals by Enya and sampling the synthesizer riff from Enya\'s song "Boadicea". It reached number 1 in the United Kingdom and in Netherlands, and number 2 in the United States, stuck for eight consecutive weeks behind the Usher singles "Yeah" and "Burn", respectively. It remains Winans\' only major success to date. As a result of its eight weeks at number 2, "I Don\'t Wanna Know" stands in joint fifth place for the most weeks at number 2 by a song which did not go to number 1, behind Foreigner\'s "Waiting for a Girl Like You", Missy Elliott\'s "Work It", Donna Lewis\'s "I Love You Always Forever" and Shania Twain\'s "You\'re Still the One".', 'title': "I Don't Wanna Know"}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"U Know What\'s Up" is a 1999 hit song by singer-songwriter-producer Donell Jones\' second studio album, "Where I Wanna Be". The song features Lisa Lopes of TLC. It reached number one on the Billboard Hot R&B/Hip-Hop Singles & Tracks chart on November 13, 1999, and stayed at number one for eight consecutive weeks. It peaked at number seven on the Billboard Hot 100, remaining there for two consecutive weeks. Outside the United States, the song peaked within the top ten of the charts in the United Kingdom. The song was produced by Edward "Eddie F" Ferrell and Darren Lighty for Untouchables Entertainment. It is Jones\'s biggest hit to date. The song was co-written by Anthony Hamilton. The songs serves as the opening track on LaFace Records.', 'title': "U Know What's Up"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Full Tilt Poker Championship at Red Rock (also FullTiltPoker.Net Championship at Red Rock) was a seven-week televised shootout poker tournament played at the Red Rock Resort Spa and Casino in Summerlin near Las Vegas, Nevada. The tournament was sponsored by online poker website Full Tilt Poker and aired by Fox Sports Net. In each of the first six episodes, six professional poker player affiliated with Full Tilt Poker played a single-table freezeout tournament. The winner of each freezeout won US$25,000 and advanced to the seven-handed final table. The seventh seat at the final table was filled by Stefan Rehn, an Internet qualifier. Tournaments featured a speed poker format, with players having 30 seconds to act on their hands with one 60-second time extension per match.', 'title': 'Full Tilt Poker Championship at Red Rock'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The 2012 United States Libertarian National Convention, in which delegates of the Libertarian Party (LP) chose the party's nominees for President of the United States and Vice President of the United States in the 2012 general election, was held May 2–6, 2012 in Las Vegas, Nevada at the Red Rock Resort Spa and Casino. Former Governor of New Mexico Gary Johnson won the presidential nomination on the first ballot. Retired California state court judge Jim Gray won the vice-presidential nomination, also on the first ballot. The convention also chose to replace most of the Libertarian National Committee party officers and members-at-large.", 'title': '2012 Libertarian National Convention'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Gametrak is a brand of 3-dimensional game control systems based on position tracking, designed for home video game platforms such as video game consoles and personal computers. The first Gametrak was invented in 2000 by Elliott Myers, who developed and guided the Gamester video game peripheral range for Leda Media Products and later Radica Games. Myers founded gaming company In2Games around Gametrak in November 2000.', 'title': 'Gametrak'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Red Rock (also known as Red Valley) is an unincorporated community and census-designated place (CDP) in Apache County, Arizona, United States. Red Rock is located on the Navajo Nation near the New Mexico border, 16 mi northeast of Lukachukai. Red Rock has a post office with ZIP code 86544; the post office uses the Red Valley name. As of the 2010 census, the Red Rock CDP had a population of 169.', 'title': 'Red Rock, Apache County, Arizona'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Delta Corp Limited, previously known as Arrow Webtex Ltd., is an Indian real estate, gaming and hospitality corporation that owns and operates casinos and hotels under several brands. The company was founded as Creole Holdings Company Pvt Ltd on 5 November 1990. It is the largest and only gaming and hospitality industry in India. Delta Corp is a public company listed on the Bombay Stock Exchange (BSE) and National Stock Exchange of India Limited (NSE). It runs the majority of the offshore casinos on Panaji, Goa. It is the largest gaming company in India with a revenue of ₹INR 2.39 billion (2016). The company operates casinos in three Indian states: Goa, Daman and Sikkim.', 'title': 'Delta Corp Limited'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'UFC Fight Night: Sanchez vs. Parisyan (also known as UFC Fight Night 6) was a mixed martial arts event held by the Ultimate Fighting Championship on August 17, 2006. The event took place at the Red Rock Resort Spa and Casino in Las Vegas, Nevada, and was broadcast live on Spike TV in the United States and Canada. It acted as a lead-in to the season four premiere of "The Ultimate Fighter". The two-hour broadcast of UFC Fight Night 6 on Spike TV drew a 1.5 overall rating. ', 'title': 'UFC Fight Night 6'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Red Rock Resort is a hotel and casino. It is owned and operated by Station Casinos on 70 acre located in Downtown Summerlin in the village of Summerlin Centre in Summerlin, Nevada. Located on Charleston Boulevard, at the interchange of Clark County 215 and some distance from the Las Vegas Strip, the resort is known as a locals casino. It is the flagship property of Station Casinos and the company's corporate headquarters is located on the property.", 'title': 'Red Rock Casino, Resort &amp; Spa'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Station Casinos is a gaming company based in the Las Vegas suburb of Summerlin, Nevada, founded by Frank Fertitta, Jr. Station Casinos, along with Affinity Gaming, Boyd Gaming, and American Casino & Entertainment Properties, dominate the locals casino market in Las Vegas. The company purchased several sites that were gaming-entitled, meaning that major casinos can be built at that location without additional approvals. There are only a limited number of such sites available in the Las Vegas area. Station has also branched out into managing casinos that they do not own. Red Rock Resorts, Inc. () is a publicly traded holding company that owns a portion of Station Casinos.', 'title': 'Station Casinos'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Red Rock River is a roughly 70 mi river in southwestern Montana in the United States. Its drainage basin covers over 1548 mi2 . Its furthest tributary, Hell Roaring Creek, originates in the Beaverhead National Forest within a few hundred meters of the North American Continental Divide and Montana-Idaho border near Brower\'s Spring, at an elevation of about 9100 ft . Brower\'s Spring is near the furthest headwaters of the Missouri River, one of the major watercourses of the central United States. The drainage flows north and west with its name changing to "Red Rock Creek" into the Red Rock Lakes in the middle of a wide grassy valley; the Red Rock River issues from the west side of Lower Red Rock Lake. It flows west, receiving many tributaries such as Peet Creek and Long Creek, widening into the Lima Reservoir and then passing through a canyon, which ends near Lima, Montana. From there, it flows northwest through a valley, passing Kidd and Red Rock, and into Clark Canyon Reservoir. Under the waters of the lake was once the confluence of the Red Rock and Horse Prairie Creek, forming the Beaverhead River, a tributary of the Jefferson River, in turn a headwater of the Missouri River.', 'title': 'Red Rock River (Montana)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Season 2 of "Hell\'s Kitchen" was cast during November 2005, started on June 12, 2006 and concluded on August 14, 2006. The winner was Heather West. Her prize was the position of executive chef at the Red Rock Resort Spa and Casino in Las Vegas with a salary of $250,000, where she worked as chef at the Terra Rossa Restaurant.', 'title': "Hell's Kitchen (U.S. season 2)"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Congo" was the first single from the Genesis album "Calling All Stations", released in September 1997. The single marked the debut of Ray Wilson as the lead vocalist for the band. It was a hit across Europe.', 'title': 'Congo (song)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Live and Acoustic is the first live CD release from Ray Wilson. It was originally released as "Unplugged" in late 2001 via his website, but was reissued in 2002 as "Live and Acoustic" by InsideOut Music. It was recorded in August 2001 during the Edinburgh Fringe Festival for which Ray played 13 sold out shows.', 'title': 'Live and Acoustic (Ray Wilson album)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'John Charles Marquez (born 5 June 1970) is a British actor and cinematographer, best known for his role as PC Joe Penhale in hit ITV drama series "Doc Martin" (2007–present) and Ray Wilson in BBC One\'s drama "In The Club" (2014–present).', 'title': 'John Marquez (actor)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'An Audience and Ray Wilson is a live acoustic album by Ray Wilson released in 2006 prior to his reforming of Stiltskin. The recording comes from a live performance given by Ray Wilson on 18 May 2003 in the Agnieszka Osiecka studio of Polish Radio in Warsaw. According to the information on the sleeve, Ray Wilson "regards this performance as the best solo concert he has done to date. The concert is a fusion of stories, humour and music and is enjoyed by a very attentive and respectful Polish audience." The CD was made available exclusively through his website.', 'title': 'An Audience and Ray Wilson'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Ray Wilson Live is a live album from Ray Wilson. It was released in February 2005.', 'title': 'Ray Wilson Live'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Jung Taek-woon (Hangul:\xa0정택운 , born on November 10, 1990), better known by his stage name Leo (Hangul:\xa0레오 ), is a South Korean singer, songwriter and musical theatre actor, signed under Jellyfish Entertainment. Known for his high-pitched, sharp, and clear vocals, Leo debuted as a member of the South Korean boy group VIXX in May 2012, and began his acting career in 2014 in the musical "Full House" as Lee Young-jae. In 2015 he began his songwriting career, and with VIXX member Ravi formed VIXX\'s first official sub-unit VIXX LR.', 'title': 'Leo (singer)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Raymond Wilson (born 8 September 1968) is a Scottish musician, best known as vocalist in the post-grunge band Stiltskin, and in Genesis from 1996 to 1998.', 'title': 'Ray Wilson (musician)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Millionairhead is the only album by Cut_, a project led by Ray Wilson. It was Wilson's first release on which he took on the majority of the songwriting duties.", 'title': 'Millionairhead'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'She is the second album by the band Stiltskin now led by Ray Wilson. The project is sometimes known as Ray Wilson & Stiltskin. The music is a fusion of diverse influences including Daft Punk, Phil Lynott, Audioslave, Metallica, David Bowie and Radiohead.', 'title': 'She (Stiltskin album)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Otis Ray Wilson (born September 15, 1957) is a former American football linebacker in the National Football League for the Chicago Bears and the Los Angeles Raiders. He won a Super Bowl as a member of the 1985 Chicago Bears. He is also the father of former Cincinnati Bengals running back Quincy Wilson.', 'title': 'Otis Wilson'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Exotic ungulate encephalopathy is a transmissible spongiform encephalopathy (TSE), or prion disease, identified in infected organs of zoo animals. This subgroup of the TSEs in captive animals was identified in zoo animals in Great Britain including species of greater kudu, nyala, gemsbok, the common eland, Arabian and Scimitar Oryx, an Ankole-Watusi cow, and an American bison. Studies indicate that transmission likely occurred via the consumption of feed supplemented with meat and bone meal, although some animals died after the British ban on ground offal in animal feed. All animals died during the 1990s, with the last death occurring in 1998.', 'title': 'Exotic ungulate encephalopathy'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Nicholas Wulstan "Nick" Park, CBE (born 6 December 1958) is an English director, writer and animator best known as the creator of "Wallace and Gromit" and "Shaun the Sheep". Park has been nominated for an Academy Award a total of six times, and won four with "Creature Comforts" (1989), "The Wrong Trousers" (1993), "A Close Shave" (1995), and "" (2005).', 'title': 'Nick Park'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Wallace & Gromit's Musical Marvels (also known as Wallace & Gromit at the Proms) is the name of Prom 20 of the 2012 season of The BBC Proms, which features orchestral renditions of Julian Nott's theme from Wallace & Gromit and classical music set to scenes from the Wallace & Gromit films. Wallace is performed by Ben Whitehead, the actor who performed Wallace in the episodic adventure game series, Wallace & Gromit's Grand Adventures. Due to its popularity, it became a full touring show in 2013, premiering at The Plenary in Melbourne, Australia on 9 February 2013.", 'title': "Wallace &amp; Gromit's Musical Marvels"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Wallace & Gromit in Project Zoo is a platform video game, the first featuring Aardman Animations' characters Wallace & Gromit. The game was developed by Frontier Developments for the PlayStation 2, Xbox (not compatible with Xbox 360), GameCube and Microsoft Windows. The game features the voice of Wallace, Peter Sallis.", 'title': 'Wallace &amp; Gromit in Project Zoo'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Wallace and Gromit\'s World of Invention is a science-themed miniseries featuring the animated claymation characters Wallace and Gromit, made by Aardman and aired on BBC One. The BBC said in a press statement that in the series, "Wallace will take a light hearted and humorous look at the real-life inventors, contraptions, gadgets and inventions, with the silent help of Gromit. The series aims to inspire a whole new generation of innovative minds by showing them real, but mind-boggling, machines and inventions from around the world that have influenced his illustrious inventing career."', 'title': "Wallace and Gromit's World of Invention"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Wallace and Gromit is a British clay animation comedy series created by Nick Park of Aardman Animations. The series consists of four short films and a feature-length film. The series centres on Wallace, a good-natured, eccentric, cheese-loving inventor, along with his companion Gromit, a silent yet loyal and intelligent anthropomorphic dog. Wallace was originally voiced by veteran actor Peter Sallis, but as of 2011, this role has been passed on to Ben Whitehead. Gromit remains silent, communicating only through means of facial expressions and body language.', 'title': 'Wallace and Gromit'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Creature Comforts is a stop motion clay animation comedy mockumentary franchise originating in a 1989 British humorous animated short film of the same name. The film matched animated zoo animals with a soundtrack of people talking about their homes, making it appear as if the animals were being interviewed about their living conditions. It was created by Nick Park and Aardman Animations. The film later became the basis of a series of television advertisements for the electricity boards in the United Kingdom, and in 2003, a television series in the same style was released. An American version of the series was also made.', 'title': 'Creature Comforts'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "On May 28, 2016, a three-year-old boy climbed into a gorilla enclosure at the Cincinnati Zoo and Botanical Garden and was grabbed and dragged by Harambe, a 17-year-old Western lowland gorilla. Fearing for the boy's life, a zoo worker shot and killed Harambe. The incident was recorded on video and received broad international coverage and commentary, including controversy over the choice to kill Harambe. A number of primatologists and conservationists wrote later that the zoo had no other choice under the circumstances, and that it highlighted the danger of zoo animals in close proximity to humans and the need for better standards of care.", 'title': 'Killing of Harambe'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Zoo Parade is an American television program broadcast from 1950 to 1957 that featured animals from the Lincoln Park Zoo in Chicago. The program\'s host was Marlin Perkins, the Zoo\'s director. Perkins went on to host the program "Wild Kingdom". Jim Wehmeyer has described the show: "A precursor of sorts to the regularly featured animal segments on "The Tonight Show" and other late-night talk shows, "Zoo Parade" was a location-bound production (filmed in the reptile house basement) during which Perkins would present and describe the life and peculiarities of Lincoln Park Zoo animals."', 'title': 'Zoo Parade'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Tata Steel Zoological Park is situated in the corner most area of Jubilee Park. This zoo is known for its Safari Park, which enables tourists to drive through the wooden area, where animals roam freely. Tourists can also visit the Nature Education Centre in the zoo, which gives information about the zoo animals.', 'title': 'Tata Steel Zoological Park'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Saab 36 (also known as Projekt 1300) was a supersonic bomber planned by Saab during the 1950s. The aircraft was intended to be able to carry an 800\xa0kg free-falling nuclear weapon, but the Swedish nuclear weapons program was cancelled in the 1960s; the plans for the bomber had been cancelled in 1957. The Saab 36 was to be fitted with delta wings, as was the Saab 35 Draken fighter. The engine was to be a version of the British Bristol Olympus turbojet, the same engine powering the Avro Vulcan jet bomber.', 'title': 'Saab 36'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Avro Atlantic (Avro 722) was a proposed civilian airliner version of the British Avro Vulcan medium jet bomber. It was a response to a 1952 UK Ministry of Supply requirement for a new aircraft suitable for both military and civilian long-range roles. Civilian models of the Vickers Valiant and Handley Page Victor V-bombers were also planned for the same contract. The Vickers V-1000 won the contest over the Atlantic, but ultimately none of these designs would be built.', 'title': 'Avro Atlantic'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Avro was a British aircraft manufacturer founded in 1910 whose designs include the Avro 504 used as a trainer in the First World War, the Avro Lancaster, one of the pre-eminent bombers of the Second World War, and the delta wing Avro Vulcan, a stalwart of the Cold War.', 'title': 'Avro'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The 1956 London Heathrow Avro Vulcan crash was a military aviation accident that occurred at Heathrow Airport on 1 October 1956 when Avro Vulcan B.1 "XA897" crashed whilst attempting to land at the airport in poor weather. The pilot and co-pilot ejected to safety but the remaining four crew were killed.', 'title': '1956 London Heathrow Avro Vulcan crash'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Avro Vulcan XH558 (military serial "XH558", civil aircraft registration "G-VLCN") "The Spirit Of Great Britain" was the last remaining airworthy example of the 134 Avro Vulcan jet powered delta winged strategic nuclear bomber aircraft operated by the Royal Air Force during the Cold War. It was the last Vulcan in military service, and the last to fly at all after 1986. It last flew on 28 October 2015.', 'title': 'Avro Vulcan XH558'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Roy Chadwick, CBE, FRSA, FRAeS (30 April 1893 – 23 August 1947) was an aircraft design engineer for the Avro Company. Born at Marsh Hall Farm, Farnworth, the son of the mechanical engineer Charles Chadwick, he was the chief designer for Avro and was responsible for practically all of their aeroplane designs. He is famous in particular for designing the Avro Lancaster bomber, its follow-up Avro Lincoln and preliminary designs of the Avro Vulcan V bomber. He also converted the Lincoln into the much-used Shackleton.', 'title': 'Roy Chadwick'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Stuart Duncan Davies CBE FEng FRAeS (5 December 1906 – 22 January 1995) was a British aerospace engineer who was in charge of the design of the Avro Vulcan. He was also responsible for converting the unsuccessful two-engined Avro Manchester into the four-engined Avro Lancaster.', 'title': 'Stuart Davies (engineer)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The 1958 Syerston Avro Vulcan crash was a military aviation accident that occurred in England on 20 September 1958 during an air show at RAF Syerston, Nottinghamshire when a prototype Avro Vulcan bomber crashed. All four crew on board and three people on the ground were killed.', 'title': '1958 Syerston Avro Vulcan crash'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Woodford Aerodrome or Manchester Woodford Aerodrome (ICAO: EGCD) is a former private airfield and aircraft factory located at Woodford, Greater Manchester. The site, which is 6 NM north of Macclesfield, Cheshire, England, was opened by the Avro company shortly after the First World War. It became an important production centre for military aircraft during the Second World War. Notable planes made at the factory include the Avro Anson, Avro Lancaster, Avro Shackleton and Avro Vulcan.', 'title': 'Woodford Aerodrome'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The Avro Vulcan (later Hawker Siddeley Vulcan from July 1963) is a jet-powered tailless delta wing high-altitude strategic bomber, which was operated by the Royal Air Force (RAF) from 1956 until 1984. Aircraft manufacturer A.V. Roe and Company (Avro) designed the Vulcan in response to Specification B.35/46. Of the three V bombers produced, the Vulcan was considered the most technically advanced and hence the riskiest option. Several scale aircraft, designated Avro 707, were produced to test and refine the delta wing design principles.', 'title': 'Avro Vulcan'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Nobel Prize in Physiology or Medicine (Swedish: "Nobelpriset i fysiologi eller medicin" ), administered by the Nobel Foundation, is awarded once a year for outstanding discoveries in the fields of life sciences and medicine. It is one of five Nobel Prizes established in 1895 by Swedish chemist Alfred Nobel, the inventor of dynamite, in his will. Nobel was personally interested in experimental physiology and wanted to establish a prize for progress through scientific discoveries in laboratories. The Nobel Prize is presented to the recipient(s) at an annual ceremony on 10 December, the anniversary of Nobel\'s death, along with a diploma and a certificate for the monetary award. The front side of the medal provides the same profile of Alfred Nobel as depicted on the medals for Physics, Chemistry, and Literature; its reverse side is unique to this medal.', 'title': 'Nobel Prize in Physiology or Medicine'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "One More River is a 1934 American drama film directed by James Whale. It was produced and distributed by Universal Pictures and starred Colin Clive, Diana Wynyard and stage actress Mrs. Patrick Campbell in one of her very few films. The film marked Jane Wyatt's screen debut. It is based on a 1933 novel by John Galsworthy.", 'title': 'One More River'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ada E. Yonath (Hebrew: עדה יונת\u200e \u200e , ] ) (born 22 June 1939) is an Israeli crystallographer best known for her pioneering work on the structure of the ribosome. She is the current director of the Helen and Milton A. Kimmelman Center for Biomolecular Structure and Assembly of the Weizmann Institute of Science. In 2009, she received the Nobel Prize in Chemistry along with Venkatraman Ramakrishnan and Thomas A. Steitz for her studies on the structure and function of the ribosome, becoming the first Israeli woman to win the Nobel Prize out of ten Israeli Nobel laureates, the first woman from the Middle East to win a Nobel prize in the sciences, and the first woman in 45 years to win the Nobel Prize for Chemistry. However, she said herself that there was nothing special about a woman winning the Prize.', 'title': 'Ada Yonath'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Nobel Prize in Physiology or Medicine (Swedish: "Nobelpriset i fysiologi eller medicin" ) is awarded annually by the Swedish Karolinska Institute to scientists and doctors in the various fields of physiology or medicine. It is one of the five Nobel Prizes established by the 1895 will of Alfred Nobel (who died in 1896), awarded for outstanding contributions in chemistry, physics, literature, peace, and physiology or medicine. As dictated by Nobel\'s will, the award is administered by the Nobel Foundation and awarded by a committee that consists of five members and an executive secretary elected by the Karolinska Institute. While commonly referred to as the Nobel Prize in Medicine, Nobel specifically stated that the prize be awarded for "physiology or medicine" in his will. Because of this, the prize can be awarded in a broader range of fields. The first Nobel Prize in Physiology or Medicine was awarded in 1901 to Emil Adolf von Behring, of Germany. Each recipient receives a medal, a diploma and a monetary award that has varied throughout the years. In 1901, von Behring received 150,782 SEK, which is equal to 7,731,004 SEK in December 2008. In 2013, the prize was awarded to James E. Rothman, Randy W. Schekman and Thomas C. Südhof; they were recognised "after discovering how cells precisely transport material". The award is presented in Stockholm at an annual ceremony on December 10, the anniversary of Nobel\'s death.', 'title': 'List of Nobel laureates in Physiology or Medicine'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Growth of the soil (Norwegian Markens Grøde), is a novel by Knut Hamsun which won him the Nobel Prize in Literature in 1920. It follows the story of a man who settles and lives in rural Norway. First published in 1917, it has since been translated from Norwegian into languages such as English. The novel was written in the popular style of Norwegian new realism, a movement dominating the early 20th century. The novel exemplified Hamsun\'s aversion to modernity and inclination towards primitivism and the agrarian lifestyle. The novel employed literary techniques new to the time such as stream of consciousness. Hamsun tended to stress the relationship between his characters and the natural environment. Growth of the Soil portrays the protagonist (Isak) and his family as awed by modernity, yet at times, they come into conflict with it. The novel contains two sections entitled "Book One" and "Book Two". The first book focuses almost solely on the story of Isak and his family and the second book starts off by following the plight of Axel and ends mainly focusing on Isak\'s family.', 'title': 'Growth of the Soil'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'John Galsworthy {\'1\': ", \'2\': ", \'3\': ", \'4\': "} ( ; 14 August 1867 – 31 January 1933) was an English novelist and playwright. Notable works include "The Forsyte Saga" (1906–1921) and its sequels, "A Modern Comedy" and "End of the Chapter". He won the Nobel Prize in Literature in 1932.', 'title': 'John Galsworthy'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Nobel Prize in Physics (Swedish: "Nobelpriset i fysik" ) is a yearly award given by the Royal Swedish Academy of Sciences for those who conferred the most outstanding contributions for mankind in the field of physics. It is one of the five Nobel Prizes established by the will of Alfred Nobel in 1895 and awarded since 1901; the others being the Nobel Prize in Chemistry, Nobel Prize in Literature, Nobel Peace Prize, and Nobel Prize in Physiology or Medicine.', 'title': 'Nobel Prize in Physics'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Since 1901, the Nobel Prize in Literature (Swedish: "Nobelpriset i litteratur" ) has been awarded annually to an author from any country who has, in the words of the will of Alfred Nobel, produced "in the field of literature the most outstanding work in an ideal direction" (original Swedish: "den som inom litteraturen har producerat det mest framstående verket i en idealisk riktning"). Though individual works are sometimes cited as being particularly noteworthy, here "work" refers to an author\'s work as a whole. The Swedish Academy decides who, if anyone, will receive the prize in any given year. The academy announces the name of the chosen laureate in early October. It is one of the five Nobel Prizes established by the will of Alfred Nobel in 1895; the others are the Nobel Prize in Chemistry, Nobel Prize in Physics, Nobel Peace Prize, and Nobel Prize in Physiology or Medicine.', 'title': 'Nobel Prize in Literature'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'This is a list of Danish Nobel laureates. Since the Nobel Prize was established per the will of Swedish inventor Alfred Nobel in 1895, 12 of the prize winners have been from Denmark. The first Danish Nobel laureate was Niels Ryberg Finsen, who won a Nobel Prize for medicine in 1903 for his work in using light therapy to treat diseases. The most recent Danish Nobel Prize winner was Jens Skou who won the prize in chemistry for his discovery over the enzyme, Na+/K+-ATPase in 1997. To date, of the 13 Nobel Prizes won by Danish people, 5 have been for medicine, 3 have been for physics, 3 have been for literature, 1 has been for chemistry and one has been for peace.', 'title': 'List of Danish Nobel laureates'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Susumu Tonegawa (利根川 進 "Tonegawa Susumu", born September 6, 1939) is a Japanese scientist who was the sole recipient of the Nobel Prize for Physiology or Medicine in 1987, for his discovery of the genetic mechanism that produces antibody diversity. Although he won the Nobel Prize for his work in immunology, Tonegawa is a molecular biologist by training and he again changed fields following his Nobel Prize win; he now studies neuroscience, examining the molecular, cellular and neuronal basis of memory formation and retrieval.', 'title': 'Susumu Tonegawa'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Goonies is a 1985 film produced by Steven Spielberg.', 'title': 'Goonies (disambiguation)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Minority Report is a 2002 American neo-noir science fiction film directed by Steven Spielberg and loosely based on the short story of the same name by Philip K. Dick. It is set primarily in Washington, D.C., and Northern Virginia in the year 2054, where "PreCrime", a specialized police department, apprehends criminals based on foreknowledge provided by three psychics called "precogs". The cast includes Tom Cruise as Chief of PreCrime John Anderton, Colin Farrell as Department of Justice agent Danny Witwer, Samantha Morton as the senior precog Agatha, and Max von Sydow as Anderton\'s superior Lamar Burgess. The film combines elements of tech noir, whodunit, thriller and science fiction genres, as well as a traditional chase film, as the main protagonist is accused of a crime he has not committed and becomes a fugitive. Spielberg has characterized the story as "fifty percent character and fifty percent very complicated storytelling with layers and layers of murder mystery and plot". The film\'s central theme is the question of free will versus determinism. It examines whether free will can exist if the future is set and known in advance. Other themes include the role of preventive government in protecting its citizenry, the role of media in a future state where technological advancements make its presence nearly boundless, the potential legality of an infallible prosecutor, and Spielberg\'s repeated theme of broken families.', 'title': 'Minority Report (film)'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "The Color Purple is a 1985 American period drama film directed by Steven Spielberg and written by Menno Meyjes, based on the Pulitzer Prize-winning novel of the same name by Alice Walker. It was Spielberg's eighth film as a director, and was a change from the summer blockbusters for which he had become famous. The film was also the first feature-length film directed by Spielberg for which John Williams did not compose the music. The film starred Danny Glover, Desreta Jackson, Margaret Avery, Oprah Winfrey (in her film debut), Adolph Caesar, Rae Dawn Chong, and featured Whoopi Goldberg (also in her film debut) as Celie Harris-Johnson.", 'title': 'The Color Purple (film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Taken, also known as Steven Spielberg Presents Taken, is a science fiction miniseries which first aired on the Sci-Fi Channel in 2002. Filmed in Vancouver, British Columbia, Canada, it was written by Leslie Bohem, and directed by Breck Eisner, Félix Enríquez Alcalá, John Fawcett, Tobe Hooper, Jeremy Paul Kagan, Michael Katleman, Sergio Mimica-Gezzan, Bryan Spicer, Jeff Woolnough, and Thomas J. Wright. The executive producers were Leslie Bohem and Steven Spielberg.', 'title': 'Taken (miniseries)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Matt Charman is a British screenwriter, playwright, and producer. He was nominated for an Academy Award for best original screenplay for his 2015 film "Bridge of Spies", directed by Steven Spielberg and co-written with Joel and Ethan Coen. Charman started out writing for theatre, making his breakthrough as writer-in-residence at London’s National Theatre, where then director Nicholas Hytner described Charman as having "a priceless nose for a story." He recently wrote the pilot episode of "Oasis", a sci-fi drama for Amazon Video adapting Michel Faber\'s "The Book of Strange New Things", and is working on a second movie for Steven Spielberg\'s Amblin Partners, based on Walter Cronkite’s 1968 visit to Vietnam.', 'title': 'Matt Charman'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Renée Elise Goldsberry (born January 2, 1971) is an American actress, singer and songwriter, known for originating the role of Angelica Schuyler Church in the Broadway musical "Hamilton", for which she won the 2016 Tony Award for Best Featured Actress in a Musical. Her other Broadway credits include Nettie Harris in the original Broadway cast of "The Color Purple", Mimi Márquez in "Rent", and Nala in "The Lion King". She has portrayed many roles on television, including Geneva Pine on "The Good Wife", and Evangeline Williamson on "One Life to Live", for which she received two Daytime Emmy Award for Outstanding Supporting Actress in a Drama Series nominations.', 'title': 'Renée Elise Goldsberry'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Stanley Kubrick is regarded by film critics and historians as one of the most influential directors of all time. Leading directors, including Martin Scorsese, Steven Spielberg, George Lucas, James Cameron, Woody Allen, Terry Gilliam, the Coen Brothers, Ridley Scott, Paul Thomas Anderson, Christopher Nolan, David Lynch, and George A. Romero, have cited Kubrick as a source of inspiration, and in the case of Spielberg, collaboration. In an interview for the "Eyes Wide Shut" DVD release, Steven Spielberg comments that "nobody could shoot a picture better in history", and that Kubrick told stories in a way "antithetical to the way we are accustomed to receiving stories". Writing in the introduction to a recent edition of Michel Ciment\'s "Kubrick", film director Martin Scorsese notes most of Kubrick\'s films were misunderstood and under-appreciated when first released, only to be considered masterpieces later on.', 'title': 'Influence of Stanley Kubrick'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Frank Wilton Marshall (born September 13, 1946) is an American film producer and director, often working in collaboration with his wife, Kathleen Kennedy. With Kennedy and Steven Spielberg, he was one of the founders of Amblin Entertainment. In 1991, he founded, with Kennedy, The Kennedy/Marshall Company, a film production company which has a contract with DreamWorks. Since May 2012, with Kennedy taking on the role of President of Lucasfilm, Marshall has been Kennedy/Marshall's sole principal. Marshall has consistently collaborated with directors Steven Spielberg, Paul Greengrass and Peter Bogdanovich.", 'title': 'Frank Marshall (producer)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Rick Carter (born 1950) is an American production designer and art director. He is known for his work in the film "Forrest Gump", which earned him an Oscar nomination, as well as numerous nominations of other awards for his work in "Amistad" and "A.I. Artificial Intelligence". Other films include "Cast Away", "War of the Worlds", "What Lies Beneath", "Jurassic Park", "Avatar", and "Back to the Future Part II" and "Part III". Many of the films that he has worked on are directed by Steven Spielberg or Robert Zemeckis. For his part in the Art Direction of "Avatar", he was awarded the Academy Award for Best Production Design alongside Robert Stromberg and Kim Sinclair. In 2013, Carter won his second Academy Award, for production design on Steven Spielberg\'s biopic, "Lincoln".', 'title': 'Rick Carter'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Akosua Gyamama Busia (born 30 December 1966) is a Ghanaian actress, film director, author and songwriter who lives in the U.K. Busia is best known for her role as Nettie Harris in the 1985 film "The Color Purple" alongside Whoopi Goldberg.', 'title': 'Akosua Busia'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'A Master of Science (Latin: "Magister Scientiae" ; abbreviated MS, M.S., MSc, M.Sc., MSci, M.Sci., ScM, Sc.M., SciM or Sci.M.) is a master\'s degree in the field of science awarded by universities in many countries, or a person holding such a degree. In contrast to the Master of Arts degree, the Master of Science degree is typically granted for studies in sciences, engineering, and medicine, and is usually for programs that are more focused on scientific and mathematical subjects; however, different universities have different conventions and may also offer the degree for fields typically considered within the humanities and social sciences. While it ultimately depends upon the specific program, earning a Master of Science degree typically includes writing a thesis.', 'title': 'Master of Science'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Rastriya Janashakti Mahila Sangh (Nepali: राष्ट्रिय जनशक्ति महिला संघ ) is a women's organisation in Nepal, politically aligned with the Rastriya Janashakti Party.", 'title': 'Rastriya Janashakti Mahila Sangh'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Rastriya Janashakti Party is a liberal political party in Nepal, led by former Prime Minister Surya Bahadur Thapa. Thapa had split away from the Rastriya Prajatantra Party in November 2004. The party is registered with the Election Commission of Nepal in March 2005.', 'title': 'Rastriya Janashakti Party'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Rastriya Janashakti Student Union is a students organisation in Nepal. It is the students wing of the Royalist Rashtriya Janashakti Party.', 'title': 'Rastriya Janashakti Student Union'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Politics in the San Francisco Bay Area is widely regarded as one of the most liberal in the country. According to the California Secretary of State, the Democratic Party holds a voter registration advantage in every congressional district, state senate district, state assembly district, State Board of Equalization districts, all nine counties, and all but three of the 101 incorporated municipalities in the Bay Area. The Republican Party holds a voter registration advantage in one state assembly subdistrict (the portion of California's 4th State Assembly district in Solano county) and three cities, Atherton, Hillsborough, and Danville.", 'title': 'Politics in the San Francisco Bay Area'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Sikkim Janashakti Party (translation: Sikkim People's Power Party), was a political party in the Indian state of Sikkim. SJP was founded in 1997, when Tara Man Rai broke away from Sikkim Ekta Manch. Rai was the president of SJP. In January 1999 SJP merged with Indian National Congress.", 'title': 'Sikkim Janashakti Party'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "iTV was a television station in Thailand owned by ITV Public Company Limited, a unit of Shin Corporation. Thailand's first UHF channel, the station was started in 1995 when the company was granted a 30-year concession by the Office of the Permanent Secretary to the Prime Minister's Office to operate a free-to-air television station in the Ultra High Frequency (UHF) spectrum at 510-790 MHz (from Channel 26 to 60). After a lengthy dispute over unpaid concession fees to the Prime Minister's Office, iTV was taken in 2007 over by the government's Public Relations Department and its name was changed to Thai Independent Television (TITV). Following a previously unannounced order of Thailand's Public Relations Department delivered the same day, the station closed down operations at the crack of dawn on January 15th, 2008. In accordance with the Public Broadcasting Service Act, the channel's frequency was assigned to the Thai Public Broadcasting Service, or Thai PBS.", 'title': 'ITV (Thailand)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Gregory Weeks (born 1970) is a lecturer at the International Relations Department at Webster University in Vienna, Austria. He was the Head of the International Relations Department from 2005 until 2011. Weeks teaches and researches civil-military relations, genocide prevention, and twentieth century Austrian and German diplomatic and military history.', 'title': 'Gregory Weeks'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The foreign relations of Finland are the responsibility of the President of Finland, who leads foreign policy in cooperation with the government. Implicitly the government is responsible for internal policy and decision making in the European Union. Within the government, preparative discussions are conducted in the government committee of foreign and security policy ("ulko- ja turvallisuuspoliittinen ministerivaliokunta"), which includes the Prime Minister and at least the Minister of Foreign Affairs and the Minister of Defence, and at most four other ministers as necessary. The committee meets with the President as necessary. Laws concerning foreign relations are discussed in the parliamentary committee of foreign relations ("ulkoasiainvaliokunta, utrikesutskottet"). The Ministry of Foreign Affairs implements the foreign policy.', 'title': 'Foreign relations of Finland'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Hari Bahadur Basnet is a Nepalese politician. He is the head of the Foreign Relations Department of the Rastriya Janashakti Party. Basnet holds a M.Sc. in Engineering.', 'title': 'Hari Bahadur Basnet'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': '"Makin\' Up for Lost Time (The Dallas Lovers\' Song)" is a song recorded as a duet by American country music artists Crystal Gayle and Gary Morris. "Makin\' Up for Lost Time" was from the CBS TV series "Dallas". It was released in October 1985 as the first single from the album "What If We Fall in Love? ". The song was the most successful country hit for the duo of Crystal Gayle and Gary Morris. The single went to number one for one week and spent a total of fourteen weeks on the country chart. Morris wrote the song with Dave Loggins.', 'title': "Makin' Up for Lost Time (The Dallas Lovers' Song)"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The discography of American country music singer Ronnie Milsap consists of 28 albums and 69 singles. Since releasing his first album in 1971, Milsap has had 40 #1 hits on the "Billboard" country chart and sold over 35 million albums. In addition, 26 of his U.S. #1 hits reached #1 on the "RPM" Top Country Tracks chart in Canada; three songs that did not reach #1 in the U.S. were #1 in Canada; and two of his U.S. #1 country hits also topped the U.S. adult contemporary chart. As of 2000, he has recorded 7 gold albums, 1 platinum album, and 1 double-platinum album.', 'title': 'Ronnie Milsap discography'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Jacek Kawalec (born 22 September 1961 in Warsaw) is a Polish actor, game show and television personality. He gained popularity as a host of one of the first American shows to be licensed and remade to be broadcast on Polish television - 'Randka w ciemno' (the format of The Dating Game). After he quit the show in 1998, due to a fire accident which was broadcast live, Kawalec became as a dubbing actor in animated motion pictures with leading roles in such hits as 'Gdzie jest Nemo?' (Finding Nemo) or 'Epoka lodowcowa' (Ice Age). Later on, he was offered a role in a popular TV series 'Ranczo' and his face became well known again in Poland, as he created a character of a local teacher of Polish literature.", 'title': 'Jacek Kawalec'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Hits (stylized as ...Hits), released in 1998 and again in 2008, following the success of "In the Air Tonight" on the Cadbury ad campaign, is the first greatest hits album by English singer-songwriter Phil Collins. The collection included fourteen Top 40 hits, including seven American number 1 songs, spanning from the albums "Face Value" (1981) through "Dance into the Light" (1996). One new Collins recording, a cover of Cyndi Lauper\'s "True Colors", also appeared on the collection and was a popular song on adult contemporary stations. "Hits" was also the first Phil Collins album to include four songs originally recorded for motion pictures (all of them U.S. number 1 hits) as well as his popular duet with Philip Bailey, "Easy Lover" (a UK number 1 hit).', 'title': 'Hits (Phil Collins album)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Louis Jordan was an American popular music innovator who recorded from the 1930s until the 1970s. During the 1940s, he was the most popular recording artist of the soon-to-be-called rhythm and blues music. Jordan had eighteen No. 1 hits, which places him as the third most successful singles artist in "Billboard" R&B charts history. His 1946 recording of "Choo Choo Ch\'Boogie" is tied for first place for spending the most weeks (eighteen) at No. 1. Jordan\'s success was not limited to the R&B market — he also had No. 1 hits on the Billboard Pop and Country charts.', 'title': 'Louis Jordan discography'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Crystal Gayle (born Brenda Gail Webb; January 9, 1951) is an American country music singer. Best known for her 1977 country-pop crossover hit song, "Don\'t It Make My Brown Eyes Blue", she had twenty #1 country hits during the 1970s and 1980s (18 on "Billboard" and 2 on "Cashbox") and six albums certified gold by the Recording Industry Association of America. Gayle became the first female artist in country music history to reach platinum sales, with her 1977 album "We Must Believe in Magic". Also noted for her nearly floor-length hair, she was voted one of the 50 most beautiful people in the world by "People" magazine in 1983. She is the younger sister of the country singer-songwriter Loretta Lynn and the singer Peggy Sue and a distant cousin of singer Patty Loveless. Gayle is a member of the Grand Ole Opry and has a star on the Hollywood Walk of Fame, near Lynn\'s star.', 'title': 'Crystal Gayle'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'William (Will) Hanrahan is a British television/radio producer and presenter best known for working on BBC programmes such as "Watchdog" and "Good Morning". Since 1994 he has headed an independent TV company which currently produces studio programming and documentaries for the BBC and Sky TV, A&E, Foxtel, CBS, Discovery and UKTV. He is a three-times Royal Television Society Award winner and his programmes are currently airing in over 70 countries. He has executive produced for both the BBC and ITV working with Alistair McGowan on the BBC Restoration project, and Chris Tarrant on the BBC Four History of the World in 100 objects series. He has recently executive produced a TV series with the renowned Italian criminologist, Massimo Picozzi, for the skyitalia series \'Segreti, Bugie e Omicidi, an Italian language documentary season which helped launch CI Italia. He is a law graduate with experience in consumer and legal programming. In 2013/14, Hanrahan also returned to radio presenting as a guest host on BBC Radio in 2014 and 2015. In 2017, his legal TV series \'The Jury Room\' for CBS Reality also saw him present a six-part Podcast.', 'title': 'Will Hanrahan'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Brian D. Siewert, alternatively credited with or without his middle initial, is an American public speaker, multiple Emmy-Award winning concert and television composer, producer, musician, arranger and visual artist. He has worked on "The Guiding Light - CBS" (1996–2009) as Principal Composer/Songwriter, "As the World Turns - CBS" (1995-2010) as Principal Composer/Songwriter and Supervising Music Producer, "General Hospital" - ABC (TV Series), "The Oprah Winfrey Show (TV series)", "The Ellen DeGeneres Show" (2003), "Another World (TV series) - NBC" (1995-1999),"The Tyra Banks Show" Syndicated, "The Dr. Oz Show" Syndicated, "Sunset Beach (TV series) - NBC" (1997-1998), "eXtra (TV series) - Syndicated", "Access Hollywood (TV series) - Syndicated", "Street Smarts", "elimiDATE", "Celebrity Justice", "The Sharon Osbourne Show", and "The Real Gilligan\'s Island". Siewert is the recipient of both ASCAP and BMI (Broadcast Music, Inc.) Awards for his work in Film/TV Music.', 'title': 'Brian Siewert'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Lisa Angelle (New Orleans, Louisiana) is an American country music singer-songwriter. During the 1980s and 1990s, Angelle wrote songs for several country artists including Wynonna Judd, who reached number one on the "Billboard" Hot Country Singles & Tracks chart in 1991 with "I Saw the Light", co-written by pop singer Andrew Gold. As a recording artist, Angelle released two singles with EMI America Records in 1985, but did not release an album until 2000 via DreamWorks Nashville. She also recorded the theme song for the CBS TV series "Beauty and the Beast", which aired 1987 to 1990.', 'title': 'Lisa Angelle'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Collingwood & Co. (formerly Collingwood O'Hare) is a TV animation studio based in London headed by writer/director Tony Collingwood. They were responsible for animated TV series 'Oscar's Orchestra', 'Dennis the Menace', 'Gordon the Garden Gnome', 'Yoko! Jakamoko! Toto!' and 'The Secret Show', among others.", 'title': 'Collingwood &amp; Co.'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Shayne Workman (born December 5, 1978) is an American author, actor, theatre director and stage manager. His first work, \':A Journey to the Spirit Realm", was published in late autumn 2014. It was later added to his anthology, "The Spirit Realm: An Anthology of Fables From The Spirit Realm". He has also penned, The Diary Of A Vagabond King, an inspiring true account of his personal experiences over the course of two years, where he was faced with impossible odds, and tragic losses. The royalties from the sale of the book will be going towards the creation and operation of the Blue Purity Fund created for aiding organizations with programs aimed at getting the nations homeless off the streets and back into being full members of society.', 'title': 'Shayne Workman'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Heidi Ewing is a director, producer, and writer of documentary films. She and Rachel Grady founded Loki Films in 2001, and have collaborated on several documentaries together. She is best known as the co-director of "Jesus Camp", which was nominated for an Academy Award for best documentary in 2006. Next came"12th & Delaware" (HBO), which premiered at the 2010 Sundance Film Festival. The film "casts a heart-rending light on the abortion divide" (LA Times) and was honored with a Peabody Award. "Detropia", a poetic look at Ewing\'s home town, also won several awards, including Best Editing at Sundance 2012, Outstanding Direction and Outstanding Original Score, at the 2013 Cinema Eye Honors for Nonfiction Filmmaking and a News and Documentary Emmy for editing. "Norman Lear: Just Another Version of You" was the opening night selection of the 2016 Sundance Film Festival and premiered on PBS American Masters on October 25, 2016. Other films as a director include "The Boys of Baraka", "Freakonomics", and "The Education of Mohammed Hussein".', 'title': 'Heidi Ewing'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Freakonomics Radio is an American public radio program which discusses socioeconomic issues for a general audience. The show is a spin-off of the 2005 book "Freakonomics". Journalist Stephen Dubner hosts the show, with economist Steven Levitt as a regular guest. The show is also distributed as a podcast, and is among the most popular on iTunes. Created in September 2010, it is a weekly podcast. Twice a year, a series of one-hour "Freakonomics Radio" specials air on public-radio stations around the country.', 'title': 'Freakonomics Radio'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Psycho Realm is an American hip hop group started in 1989 by brown man & brothers Sick Jacken (Joaquin Gonzalez) and Big Duke (Gustavo Gonzalez) from the Downtown, Pico-Union area of Los Angeles. The first recorded Psycho Realm song, "Scandalous," was released on the soundtrack of the film Mi Vida Loca in 1994. That same year B-Real of the rap group Cypress Hill saw Psycho Realm performing at Olvera Street for an End Barrio Warfare concert. Their performance inspired B-Real to the point that he wanted to join the group. With this time period being the height of Cypress Hill’s career anything Cypress Hill related would get major publicity.', 'title': 'Psycho Realm'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Freakonomics: The Movie is a 2010 American documentary film based on the 2005 book "Freakonomics: A Rogue Economist Explores the Hidden Side of Everything" by economist Steven D. Levitt and writer Stephen J. Dubner. The film premiered at the Tribeca Film Festival in April 2010 with a theatrical release later in the year. The film received a lukewarm reception and a 65% fresh rating at Rottentomatoes.', 'title': 'Freakonomics (film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Peter W. Smith (February 23, 1936 – May 14, 2017) was an American investment banker from Chicago. He had a 40-year career managing corporate acquisitions and venture investments. He was active in Republican politics. In 1998 he was identified as a major financial supporter of the 1993 Troopergate story, in which several Arkansas state troopers accused U.S. President Bill Clinton of having carried out sexual dalliances while he was Governor of Arkansas. In 2017 he confirmed to the "Wall Street Journal" that he had tried in 2016 to contact computer hackers, including Russian hackers, in an attempt to obtain opposition research material to use against Hillary Clinton in the 2016 presidential election. Ten days after speaking to the paper, he committed suicide in a hotel room, citing ill health.', 'title': 'Peter W. Smith'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Hackers is a 1995 American crime film directed by Iain Softley and starring Jonny Lee Miller, Angelina Jolie, Renoly Santiago, Matthew Lillard, Jesse Bradford, Lorraine Bracco, and Fisher Stevens. The film follows a group of high school hackers and their involvement in a corporate extortion conspiracy. Made in the 1990s when the internet was unfamiliar to the general public, it reflects the ideals laid out in the Hacker Manifesto quoted in the film: "This is our world now... the world of the electron and the switch [...] We exist without skin color, without nationality, without religious bias... and you call us criminals. [...] Yes, I am a criminal. My crime is that of curiosity." "Hackers" has achieved cult classic status.', 'title': 'Hackers (film)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'In The Realm of the Hackers is a 2003 Australian documentary directed by Kevin Anderson about the prominent hacker community, centered in Melbourne, Australia in the late 1980s until early 1990. The storyline is centered on the Australian teenagers going by the hacker names "Electron" and "Phoenix", who were members of an elite computer hacking group called \'The Realm\' and hacked into some of the most secure computer networks in the world, including those of the US Naval Research Laboratory, Lawrence Livermore National Laboratory, a government lab charged with the security of the US nuclear stockpile, and NASA. The film runs for 55 minutes and was inspired by the book "Underground", by Melbourne-based writer and academic Suelette Dreyfus.', 'title': 'In the Realm of the Hackers'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Jason Scott "Jay" Leiderman (born April 12, 1971) is an American criminal defense lawyer based in Ventura, California. " The Atlantic" Magazine called Leiderman the "Hacktivist’s Advocate" for his work defending hacker-activists accused of computer crimes, or so-called (“Hacktivism”) especially people associated with Anonymous. Leiderman "keeps an encrypted chat app open at all times so he can dispense ad hoc pro bono legal advice to members of Anonymous" Buzzfeed called Leiderman "The Maserati-Driving Deadhead Lawyer Who Stands Between Hackers And Prison" and stated he was "A medical marijuana and criminal defense lawyer from Southern California [who] has made himself into the country’s leading defender of hackers."', 'title': 'Jay Leiderman'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Robin Goldstein is an American author, food and wine critic, and economics pundit. He is known for his books and articles questioning conventional wisdom and pricing in the food and wine industries, particularly a widely publicized exposé of Wine Spectator magazine, and for his writing on the Freakonomics blog. He is author of several books, including "The Wine Trials" (the world\'s bestselling guide to cheap wine), "The Beer Trials", and an upcoming book tentatively entitled "A Defense of Fast Food". Goldstein was also one of the subjects of "Think Like a Freak", the 2014 book by "Freakonomics" authors Steven Levitt and Stephen Dubner. He lives in Oakland, California.', 'title': 'Robin Goldstein'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Sioux Falls Regional Airport (IATA: FSD,\xa0ICAO: KFSD,\xa0FAA LID: FSD) , also known as Joe Foss Field, is a public and military use airport owned by the Sioux Falls Regional Airport Authority and located three\xa0nautical miles (6\xa0km) northwest of the central business district of Sioux Falls, a city in Minnehaha County, South Dakota, United States. Named in honor of aviator Joe Foss, it serves the greater Sioux Falls area, as well as communities throughout eastern South Dakota, southwestern Minnesota and northwestern Iowa.', 'title': 'Sioux Falls Regional Airport'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Guadalcanal Campaign, also known as the Battle of Guadalcanal and codenamed Operation Watchtower was a military campaign fought between 7 August 1942 and 9 February 1943 on and around the island of Guadalcanal in the Pacific theater of World War II. It was the first major offensive by Allied forces against the Empire of Japan.', 'title': 'Guadalcanal Campaign'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The 114th Fighter Wing (114 FW) is a unit of the South Dakota Air National Guard, stationed at Joe Foss Field Air National Guard Station, Sioux Falls, South Dakota. If activated to federal service, the Wing is gained by the United States Air Force Air Combat Command.', 'title': '114th Fighter Wing'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The 175th Fighter Squadron is a unit of the South Dakota Air National Guard 's 114th Operations Group stationed at Joe Foss Field Air National Guard Station, Sioux Falls, South Dakota. The 175th is equipped with the F-16C/D Fighting Falcon.", 'title': '175th Fighter Squadron'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Marine Fighter Attack Squadron 115 (VMFA-115) is a United States Marine Corps F/A-18 Hornet squadron. Officially nicknamed the "Silver Eagles" and on occasion "Joe\'s Jokers" after their first commanding officer Major Joe Foss, the squadron is based at Marine Corps Air Station Beaufort, South Carolina and falls under the command of Marine Aircraft Group 31 (MAG-31) and the 2nd Marine Aircraft Wing (2nd MAW). The squadron has seen combat during World War II, the Korean and Vietnam Wars and has deployed in support of Operation Iraqi Freedom with a final deployment in 2008 to Al Asad Airbase in western Iraq. The Squadron radio callsign is ""Blade""', 'title': 'VMFA-115'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The American Sportsman was an American television series from 1965 to 1986 on ABC which presented filmed highlights involving the program's hosts and celebrities participating in hunting and/or fishing trips along with outdoor recreational activities such as whitewater kayaking, hang gliding and free climbing. It was typically presented on Sunday afternoons, frequently following coverage of live sporting events. From 1965 to 1967, the program was hosted by former South Dakota Republican Governor, American Football League commissioner, and World War II hero Joe Foss; it was later hosted by Grits Gresham, an outdoorsman from Natchitoches, Louisiana, and long-time sports announcer Curt Gowdy.", 'title': 'The American Sportsman'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Karen Foss (born January 26, 1950) is a gender and rhetoric scholar, previous head of the Department of Communication and Journalism at the University of New Mexico, and former professor at the University of New Mexico and Humboldt State University in California. During Foss’s journey as an undergraduate she was introduced to feminism and decided to pursue the intersectionality of feminism, communication, and rhetorical theory further. After Foss received her Ph.D. she put her passion into practice, teaching university students about feminist perspectives and how these perspectives impact society. Throughout Foss’s career, she has published and contributed to over 70 scholarly works. In addition, Foss has received 11 honors for her numerous contributions and publications.', 'title': 'Karen Foss (feminist scholar)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Joe Foss High School is an alternative school located in Sioux Falls, South Dakota. In September 2015, the original building was sold to a religious group for $600,000, and the classes were moved to the former building of Axtell Park Middle School. The high school is operated alongside multiple other at-risk programs in the building, such as programs for middle school students, and suspensions from other schools in the district.', 'title': 'Joe Foss High School (Sioux Falls, South Dakota)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Joseph Jacob "Joe" Foss (April 17, 1915 – January 1, 2003) was a United States Marine Corps major and the leading Marine fighter ace in World War II. He received the Medal of Honor in recognition of his role in air combat during the Guadalcanal Campaign.', 'title': 'Joe Foss'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Joe Foss Institute is a nonprofit organization in the United States that aims to promote an appreciation among students for the American tradition of liberty, the country\'s military history, and patriotic values. It was founded in 2001 by flying ace and politician Joe Foss, and is headquartered in Scottsdale, Arizona. The institute lists its five values as "freedom, patriotism, integrity, service, and character", and targets its programs at military veterans, students, and teachers.', 'title': 'Joe Foss Institute'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Karl Julius Sillig (12 May 1801 – 14 January 1855) was a German classics scholar, and pupil of Karl August Böttiger. Sillig went on to edit many of Böttiger\'s works after the latter\'s death in 1835. He also revised and edited the work of other scholars, such as Christian Gottlob Heyne. Heyne published an edition of the poem "Culex" from the "Appendix Vergiliana", a collection of verse often attributed at least in part to Virgil, and attempted to cull the lines he thought not genuinely produced by Virgil; an approach of which Sillig was highly critical when he revised Heyne\'s works.', 'title': 'Karl Julius Sillig'}
