 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Karl Julius Christian Adalbert Heinrich Ferdinand von Koseritz, known simply as Karl von Koseritz (Dessau, 1834-Porto Alegre, 1890) was a German-Brazilian journalist, writer, teacher, playwright and politician. He fought in the First Schleswig War as a soldier, before moving to Brazil. After arriving in 1851, he established himself in Pelotas in the province of Rio Grande do Sul. He worked as a cook, painter and bookkeeper before becoming a journalist. In 1856 he married a Brazilian woman and changed his first name to Carlos. In 1886, already living in Porto Alegre, he became editor of "A Reforma", the Liberal Party\'s official newspaper, which headed the abolitionist campaign in the province. He continued a monarchist until his death, and was seen as an important person in the German colonies of Rio Grande do Sul', 'title': 'Karl von Kosertiz'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Freiburg im Breisgau (] ; Alemannic: "Friburg im Brisgau" [ˈfʁiːb̥əɡ̊] ; French: "Fribourg-en-Brisgau" ) is a city in Baden-Württemberg, Germany with a population of about 220,000. In the south-west of the country, it straddles the Dreisam river, at the foot of the Schlossberg. Historically, the city has acted as the hub of the Breisgau region on the western edge of the Black Forest in the Upper Rhine Plain. A famous old German university town, and archiepiscopal seat, Freiburg was incorporated in the early twelfth century and developed into a major commercial, intellectual, and ecclesiastical center of the upper Rhine region. The city is known for its medieval minster and Renaissance university, as well as for its high standard of living and advanced environmental practices. The city is situated in the heart of the major Baden wine-growing region and serves as the primary tourist entry point to the scenic beauty of the Black Forest. According to meteorological statistics, the city is the sunniest and warmest in Germany and held the all-time German temperature record of 40.2 °C from 2003 to 2015.', 'title': 'Freiburg im Breisgau'}
