 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Fritz Odemar (13 January 1890 – 6 June 1955) was a German film actor. He appeared in 152 films between 1927 and 1955. He was born in Hannover, Germany and died in Munich, Germany. Odemar's father was the actor Fritz Odemar Sr. (Karl Julius Friedrich Odemar; 1858–1926).", 'title': 'Fritz Odemar'}
