 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Good Night, and Good Luck is a 2005 American historical drama film directed by George Clooney and starring David Strathairn, George Clooney, Robert Downey, Jr., Patricia Clarkson and Jeff Daniels. The movie was written by Clooney and Grant Heslov (both of whom also have acting roles in the film) and portrays the conflict between veteran radio and television journalist Edward R. Murrow and U.S. Senator Joseph McCarthy of Wisconsin, especially relating to the anti-Communist Senator's actions with the Senate Permanent Subcommittee on Investigations.", 'title': 'Good Night, and Good Luck'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Johan Leysen (born 19 February 1950) is a Belgian actor. He has appeared in more than 130 films and television shows since 1977. He starred in the film "De grens", which was screened in the Un Certain Regard section at the 1984 Cannes Film Festival. In 1998 he won the Golden Calf for Best Actor for his role in the movie "Felice...Felice...". In the 2010 film "The American", he appeared as Pavel, mysterious handler of Jack, the assassin character played by George Clooney.', 'title': 'Johan Leysen'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Young & Beautiful (French: Jeune & Jolie ) is a 2013 French drama film of adolescent sexuality directed by François Ozon and produced by Eric and Nicolas Altmayer. The film stars Marine Vacth in the leading role of Isabelle, a teenage prostitute, and features supporting performances by Johan Leysen, Géraldine Pailhas, Frédéric Pierrot, and Charlotte Rampling. The film was nominated for the Palme d'Or at the 2013 Cannes Film Festival, and received praise from the film critics. It was shown at the 2013 Toronto International Film Festival.", 'title': 'Young &amp; Beautiful'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'George Timothy Clooney (born May 6, 1961) is an American actor, director, producer, screenwriter, activist, businessman, and philanthropist. He has received three Golden Globe Awards for his work as an actor and two Academy Awards, one for acting in "Syriana" (2006) and the other for co-producing "Argo" (2012).', 'title': 'George Clooney'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Syriana is a 2005 American geopolitical thriller film written and directed by Stephen Gaghan, and executive produced by George Clooney, who also stars in the film with an ensemble cast. Gaghan\'s screenplay is loosely adapted from Robert Baer\'s memoir "See No Evil". The film focuses on petroleum politics and the global influence of the oil industry, whose political, economic, legal, and social effects are experienced by a Central Intelligence Agency operative (George Clooney), an energy analyst (Matt Damon), a Washington, D.C. attorney (Jeffrey Wright), and a young unemployed Pakistani migrant worker (Mazhar Munir) in an Arab state in the Persian Gulf. The film also features an extensive supporting cast including Amanda Peet, Tim Blake Nelson, Mark Strong, Alexander Siddig, Amr Waked, and Academy Award winners Christopher Plummer, Chris Cooper and William Hurt.', 'title': 'Syriana'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Le Lit is a 1982 drama film directed by Marion Hänsel and based on the 1960 novel of the same name by Dominique Rolin. The film starred Heinz Bennent, Natasha Parry, and Johan Leysen. "Le Lit" received the André Cavens Award for Best Film given by the Belgian Film Critics Association (UCC).', 'title': 'Le Lit'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Gordon Johndroe (born 1974) is vice president of Government Operations Communications at The Boeing Company. He was named to this position in November 2014 and is responsible for developing and implementing communications strategies associated with advocacy for the company’s products and businesses, as well as issues management and outreach to the Washington, D.C. news media and related constituencies. Johndroe previously worked at Lockheed Martin from 2013-2014 as Vice President for Worldwide Media Relations. He served as chief spokesperson for the corporation, counsels senior leaders on media engagements and oversees Lockheed Martin’s media relations campaigns and strategies. Prior to joining Lockheed Martin, he served as Deputy Assistant to President George W. Bush, Deputy Press Secretary and a spokesman for the United States National Security Council', 'title': 'Gordon Johndroe'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Alfred Balk (July 24, 1930 – November 25, 2010) was an American reporter, nonfiction author and magazine editor who wrote groundbreaking articles about housing segregation, the Nation of Islam, the environment and Illinois politics. His refusal to identify a confidential source led to a landmark court case. During a career-long emphasis on media improvement, he served on the Twentieth Century Fund\'s task force that established a National News Council, consulted for several foundations, served as secretary of New York Governor Nelson Rockefeller\'s Committee on the Employment of Minority Groups in the News Media, and produced a film, "That the People Shall Know: The Challenge of Journalism", narrated by Walter Cronkite. He wrote and co-authored books on a variety of topics, ranging from the tax exempt status of religious organizations to globalization to the history of radio.', 'title': 'Alfred Balk'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Jim Lentz is the chief executive officer for Toyota North America; president and chief operating officer of Toyota Motor North America, Inc. (TMA); and a senior managing officer of the parent company Toyota Motor Corporation (TMC) which is located in Japan. In that role Lentz manages all of Toyota’s North American affiliate companies which include TMA, Toyota Motor Sales, U.S.A., Inc. (TMS), and Toyota Motor Engineering & Manufacturing, North America, Inc. (TEMA), which includes responsibilities for Toyota Motor Manufacturing Canada Inc. (TMMC), and oversight for Toyota Canada, Inc. (TCI). Lentz also serves as the chairman of the North American Executive Committee. This is composed of the top leaders from the affiliate companies. Most recently Lentz was the president and chief executive officer of TMS and senior vice president of TMA and served in a global advisory capacity as the managing officer for TMC. Before that he served as president and chief operating officer and executive vice president of TMS. Lentz previously held several executive positions including Toyota division group vice president and general manager where he oversaw all sales, logistics and marketing activities for Toyota and Scion regional sales offices and distributors. He also served as the group vice president of marketing for the Toyota division and vice president of Scion, and was responsible for the initial launch of a new line of vehicles. Lentz spent several years in the field as vice president and general manager of the Los Angeles region and before that general manager of the San Francisco region. Prior to his role as general manager Lentz was vice president of marketing services for CAT in Maryland. He has also held several other TMS positions, including field training manager, sales administration manager and truck sales team member. Lentz joined Toyota in 1982 as the merchandising manager for its Portland, Oregon region where he later became the distribution manager and field operations manager. He serves as chairman on the board of directors of The Global Automakers and is also a member of the executive advisory board for Daniels College of Business at the University of Denver (DU), his alma mater. He was named “Marketer of the Year” by Advertising Age in 2006, an Automotive News “All Star” in 2007 and honored at Industry Leader of the year.', 'title': 'Jim Lentz'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Robert E. Nyce is a former Republican member of the Pennsylvania House of Representatives. A graduate of Northampton Area Senior High School, Northampton, PA and Moravian College, Bethlehem, PA for over twenty years he was a tax professional working at Lehigh Portland Cement Company, Allentown, PA from 1970 to 1973, Manager, Credit Taxes, Insurance and Payroll at Frick Company, Waynesboro, PA from 1973 to 1975, Senior Tax Accountant for Bethlehem Steel Corporation from 1975 to 1985 and Asst. Vice President, Taxes for Chrysler First, Inc., Allentown, PA from 1985 to 1990. He was a member of the Tax Executives Institute including Chairman of the State Tax Committee in the 1980s. During his private sector employment, Mr. Nyce was active in his community of East Allen Township. From 1979 to 1984 he served as a member and Chairman of the East Allen Township Municipal Authority and again from 2007 to 2013 as a member and Treasurer. From 2011 to 2013 Mr. Nyce negotiated and helped close the sale of the East Allen Township Municipal Authority\'s assets to The City of Bethlehem and the Bath Borough Municipal Authority thereby ensuring high quality service of water and sewer for the future for all residents of East Allen Township. From 1984 to 1990, Mr. Nyce served on the Northampton Area School District Board of Directors as member, Vice Chairman and Chairman. He also served on the Bethlehem Area Vocational Technical School Joint Operating Committee as member, Vice Chairman and Chairman. In both capacities, he was responsible for normal business operations and participated in union contract negotiations with staff. In 1990, Mr. Nyce ran for and was elected State Representative for the 138th PA House District encompassing parts of Northampton and Monroe Counties. During his three terms in the House of Representatives he served on several important committees: Education, Local Government, Fish and Game, Finance to name a few. In 1996 he ran for PA Auditor General in an unsuccessful bid to represent the people of PA as their financial watchdog. Following the campaign, he was hired as the Executive Director of the Pennsylvania Independent Regulatory Review Commission (IRRC). Mr. Nyce served for eight years in that capacity overseeing two major revisions to the Regulatory Review Act and many significant regulatory issues facing the residents of Pennsylvania. The PA IRRC reviews all regulations promulgated in PA and provides citizens an opportunity to comment on and affect those regulations prior to their promulgation by the state agency that authored the regulation. The two exceptions are the PA Fish and Boat Commission and the PA Game Commission which remain outside the regulatory review process. In 2005, Mr. Nyce retired from state government and now resides in Northampton County. He has been a member of the Free and Accepted Masons of PA since 1971 and the Rajah Shrine, Reading, PA since the mid-ninety\'s. Mr. Nyce is a past member of the Northampton Exchange Club. Mr. Nyce served in the U.S. Army from 1966 to 1969. Having completed his basic training at Fort Knox, Kentucky and Advanced Individual Training at Fort Lewis, Washington he was assigned to the 1st Battalion, 3rd Infantry Unit, "The Old Guard" at Arlington National Cemetery where he served for about two and one half years attaining the rank of Staff Sergeant, E-6 before taking an early release to return to Moravian College in September 1969. While serving at Arlington, SSG Nyce participated in former President Dwight D. Eisenhower\'s funeral, President Nixon\'s Inauguration and Robert F. Kennedy\'s Funeral.', 'title': 'Robert Nyce'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Cynthia C. Hogan (born Cincinnati, Ohio about 1958) is the Vice President for Public Policy and Government Affairs at Apple. Previously Hogan served as Senior Vice President of Public Policy and Government Affairs for the National Football League, and prior to that as the Counsel to the Vice President of the United States, Joe Biden, under President Barack Obama. Hogan previously worked as Chief Counsel to Vice President Biden during his time in the United States Senate and served as Staff Director of the Senate Judiciary Committee.', 'title': 'Cynthia Hogan'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Gore-Chernomyrdin Commission, or U.S.-Russian Joint Commission on Economic and Technological Cooperation, was a United States and Russian Joint Commission developed to increase cooperation between the two countries in several different areas. The Commission was developed by the United States’ President Bill Clinton and Russian President Boris Yeltsin at a summit in Vancouver in April 1993. Al Gore, the United States Vice President, and Victor Chernomyrdin, the Russian Prime Minister, were appointed as co-chairmen, and the committee derives its name from those two individuals. Before his appointment to the Commission, Chernomyrdin oversaw the Soviet national oil industry as minister from 1985-1989. After the fall of the Soviet Union, Chernomyrdin organized the Soviet oil industry into the Gazprom corporation.', 'title': 'Gore-Chernomyrdin Commission'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Nelson Aldrich Rockefeller (July 8, 1908 – January 26, 1979) was an American businessman and politician. He served as the 41st Vice President of the United States from 1974 to 1977, and previously as the 49th Governor of New York (1959–1973). He also served as Assistant Secretary of State for American Republic Affairs for Presidents Franklin D. Roosevelt and Harry S. Truman as well as Under Secretary of Health, Education and Welfare under Dwight D. Eisenhower. A member of the wealthy Rockefeller family, he was also a noted art collector, as well as administrator of Rockefeller Center in Manhattan, New York.', 'title': 'Nelson Rockefeller'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The president pro tempore of the United States Senate ( or ), also president pro tem, is the second-highest-ranking official of the United States Senate. of the United States Constitution provides that the Vice President of the United States is, despite not being a senator, the President of the Senate, and mandates that the Senate must choose a president "pro tempore" to act in the Vice President\'s absence. Unlike the vice president, the president pro tempore is an elected member of the Senate, able to speak or vote on any issue. Selected by the Senate at large, the president pro tempore has enjoyed many privileges and some limited powers. During the vice president\'s absence, the president pro tempore is empowered to preside over Senate sessions. In practice, neither the vice president nor the president pro tempore usually presides; instead, the duty of presiding officer is rotated among junior senators of the majority party to give them experience in parliamentary procedure.', 'title': 'President pro tempore of the United States Senate'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Executive Order 10925, signed by President John F. Kennedy on March 6, 1961, required government contractors to "take affirmative action to ensure that applicants are employed and that employees are treated during employment without regard to their race, creed, color, or national origin." It established the President\'s Committee on Equal Employment Opportunity (PCEEO), which was chaired by then Vice President Lyndon Johnson. Vice Chair and Secretary of Labor Arthur Goldberg was in charge of the Committee\'s operations. This first implementation of Affirmative Action was meant to give equal opportunities in the workforce to all U.S. citizens, not to give special treatment to those discriminated against.', 'title': 'Executive Order 10925'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Gerald Rudolph Ford Jr. (born Leslie Lynch King Jr.; July 14, 1913\xa0– December 26, 2006) was an American politician who served as the 38th President of the United States from August 1974 to January 1977, following the resignation of Richard Nixon. Prior to this he served eight months as the 40th Vice President of the United States, following the resignation of Spiro Agnew. He was the first person appointed to the vice presidency under the terms of the 25th Amendment, and consequently the only person to have served as both Vice President and President of the United States without being elected to executive office. Before his appointment to the vice presidency, Ford served 25 years as U.S. Representative from Michigan's 5th congressional district, the final nine of them as the House Minority Leader.", 'title': 'Gerald Ford'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Super-Hip is a fictional character that appeared in comic books published by DC Comics. He first appeared in "The Adventures of Bob Hope" #95 (October-November 1965), in a story written by Arnold Drake and drawn by Bob Oksner.', 'title': 'Super-Hip'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Bob Oksner (October 14, 1916 in Paterson, New Jersey – February 18, 2007) was an American comics artist known for both adventure comic strips and for superhero and humor comic books, primarily at DC Comics.', 'title': 'Bob Oksner'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Amazing Spider-Man #129, with its subtitle being "The Punisher Strikes Twice!" is an 19 page long single issue of the American comic book "The Amazing Spider-Man", published by Marvel Comics in 1974. It is well-known for being the first appearance of the character of The Punisher, who at that point was portrayed as an antagonist of Spider-Man but would later become one of Marvel\'s most popular and successful characters as well as the villain the Jackal who would go on to become one of Spider-Man\'s main adversaries and an integral part of the late 90s Spider-Man storyline the "Clone Saga". In modern day the issue is considered a milestone comic and is a sought after collectible with certain copies going for several thousands of dollars. It was written by Gerry Conway and drawn by artist Ross Andru with a cover by Gil Kane and John Romita, Sr. which has been homaged, copied and parodied multiple times.', 'title': 'The Amazing Spider-Man 129'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The Arrowverse is a shared fictional universe that is centered on television series airing on The CW, developed by Greg Berlanti, Marc Guggenheim, Andrew Kreisberg, Phil Klemmer, and Geoff Johns, based on characters appearing in publications by DC Comics. The shared universe, much like the DC Universe in comic books or the cinematic DC Extended Universe, was established by crossing over common plot elements, settings, cast, and characters. The Arrowverse stars Stephen Amell as Oliver Queen / Green Arrow, Grant Gustin as Barry Allen / Flash, Megalyn Echikunwoke as Mari Jiwe McCabe / Vixen, with an ensemble cast leading "Legends of Tomorrow", including Arthur Darvill as Rip Hunter, Caity Lotz as Sara Lance / White Canary, Brandon Routh as Ray Palmer / Atom, Dominic Purcell as Mick Rory / Heat Wave, with Victor Garber and Franz Drameh as Martin Stein & Jefferson "Jax" Jackson / Firestorm. Russell Tovey stars as Ray Terrill / The Ray.', 'title': 'Arrowverse'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Centurions: Power Xtreme is a syndicated 30 minute American science fiction animated television series produced by Ruby-Spears and was animated in Japan by Sunrise. Comic book legends Jack Kirby and Gil Kane contributed to the design and concepts of the show. The series began in 1986 as a five-part miniseries and was followed with a 60 episode series. The series was story edited by Ted Pedersen and written by several authors, including prolific science fiction writers Michael Reaves, Marc Scott Zicree, Larry DiTillio and Gerry Conway. The series theme and soundtrack were composed by Udi Harpaz. There was also a line of tie-in toys by Kenner and a comic book series by DC Comics. The show revolves around the conflict between Doc Terror's cyborgs and the Centurions (a combination of hard-suit and a mecha).", 'title': 'The Centurions (TV series)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Marley Davidson (sometimes referred to as "Marley Davidson: Bronx Exorcist") is a fictional comic book character created by writer and comic book artist Sandy Jimenez. It made its first appearance on June 15, 1995 in the self-titled independent comic book "Marley Davidson", which chronicled the exploits of a Jamaican ex-priest, operating as an exorcist and monster hunter in New York City.', 'title': 'Marley Davidson'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Angel and the Ape was a humor comic book created by E. Nelson Bridwell published by DC Comics. The characters first appeared in 1968 in "Showcase" #77 then graduated to their own title, with art by comic artist Bob Oksner, most often inked by Wally Wood. The title lasted for seven issues, changing its name to "Meet Angel" for its final appearance.', 'title': 'Angel and the Ape'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Adventures of Dean Martin and Jerry Lewis is the title of a celebrity comics comic book published by DC Comics featuring the popular team of comedians Dean Martin and Jerry Lewis. The series ran for 40 issues from 1952 through 1957, at which time the title was renamed because of the real life breakup of the team. The title was continued as "The Adventures of Jerry Lewis" thereafter for issues #41-124. The new series featured the comedian Jerry Lewis in a variety of humorous situations. Infrequent guest stars included Batman, Bob Hope, Lex Luthor, Superman, the Flash. and Wonder Woman, Notable artists who worked on the series include Bob Oksner and Neal Adams.', 'title': 'The Adventures of Dean Martin and Jerry Lewis'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Codename: Assassin is a fictional antihero, a comic book character published by DC Comics. He debuted in "1st Issue Special" #11, (February 1976), and was created by Gerry Conway, Steve Skeates and Nestor Redondo (credited as the Redondo Studio).', 'title': 'Codename: Assassin'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Vixen (Mari Jiwe McCabe) is a comic book character created by Gerry Conway and Bob Oksner. She first appeared in "Action Comics" #521 (July 1981), published by DC Comics.', 'title': 'Vixen (comics)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Brady Seals (born March 29, 1969) is an American country music artist. He is the cousin of Jim Seals (of Seals & Crofts) and Dan Seals and Johnny Duncan, the nephew of Troy Seals, and the husband of former BNA Records recording artist Lisa Stewart. Seals made his debut in 1988 as co-lead vocalist and keyboardist in the sextet Little Texas, with whom he recorded until his departure in late 1994. Between then and 2002, he recorded as a solo singer, releasing three studio albums and charting in the Top 40 on the country charts with "Another You, Another Me". In 2002, Seals formed a quartet called Hot Apple Pie, in which he has recorded one studio album and charted three singles. A fourth solo album, "Play Time", was released in 2009 via Star City.', 'title': 'Brady Seals'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Thompson Street is the third solo album by American country music singer Brady Seals. It was released in February 2003 via Image Entertainment. No singles were released from it, and after its release, Seals founded the band Hot Apple Pie.', 'title': 'Thompson Street (album)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Brady Seals is the self-titled second album by American country music singer Brady Seals. It is his second release independently of the band Little Texas, of which he was a member until 1995. The album includes the singlse "I Fell", "Whole Lotta Hurt" and "The Best Is Yet to Come". All three singles charted on the "Billboard" country charts, although they all missed Top 40.', 'title': 'Brady Seals (album)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Nick Carter and Red Club (French: "Nick Carter et le trèfle rouge" ) is a 1965 French action film directed by . The film features the successful literary character Nick Carter and is based on a novel by Claude Rank. The film is a sequel to "Nick Carter va tout casser" (1964).', 'title': 'Nick Carter and Red Club'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Another You, Another Me" is a debut solo song recorded by American country music artist Brady Seals. It was released in September 1996 as the first single from the album "The Truth". The song reached #32 on the "Billboard" Hot Country Singles & Tracks chart. The song was written by Seals\' uncle, Troy Seals, along with Will Jennings.', 'title': 'Another You, Another Me'}
