 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"My Love" is a song recorded by the American country music band Little Texas. It was co-written by the band\'s keyboardist Brady Seals (who also sang lead vocals on it) and lead guitarist Porter Howell along with Tommy Barnes. It was released in January 1994 as the third single from the album, "Big Time". The song reached the top of the "Billboard" country singles charts, becoming the band\'s only Number One country hit. The song features lead vocals from Brady Seals, then the band\'s keyboardist.', 'title': 'My Love (Little Texas song)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Nickolas Gene "Nick" Carter (born January 28, 1980) is an American singer, songwriter, actor, and dancer. He is best known as a member of the pop group the Backstreet Boys. As of 2015, Carter has released three solo albums, "Now or Never", "I\'m Taking Off" and "All American" during breaks between Backstreet Boys schedules, and a collaboration with Jordan Knight titled "Nick & Knight". He has made occasional television appearances and starred in his own reality shows, "House of Carters" and "I (Heart) Nick Carter". He gained fame in the mid 1990s and early 2000s as a teen idol. He is also the older brother of singer Aaron Carter and the late Leslie Carter.', 'title': 'Nick Carter (musician)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Nick Carter, Master Detective was a Mutual radio crime drama based on tales of the fictional private detective Nick Carter from Street & Smith's dime novels and pulp magazines. Nick Carter first came to radio as The Return of Nick Carter, a reference to the character's pulp origins, but the title was soon changed to Nick Carter, Master Detective. A veteran radio dramatist, Ferrin Fraser, wrote many of the scripts.", 'title': 'Nick Carter, Master Detective'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Truth is the debut studio album of American country music singer Brady Seals, and his first solo album after leaving the country band Little Texas. It was released on February 25, 1997 on Reprise Records. The album includes the singles "Another You, Another Me", "Still Standing Tall", and "Natural Born Lovers". Of these, only "Another You, Another Me" reached Top 40 on Hot Country Songs. Seals co-wrote all but two of the album\'s songs, and co-produced the album with Rodney Crowell.', 'title': 'The Truth (Brady Seals album)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Rebels of the Neon God () is a 1992 Taiwanese film by Tsai Ming-liang. It is his first full-length film. It tells two stories of Taipei youth. One details alienated buxiban student Hsiao Kang (Lee Kang-sheng) and his troubled interactions with his family. The other shows two petty hoods, Ah Tze and Ah Ping, along with Ah Kuei, Tze's erstwhile girlfriend. An idle act of violence brings the two groups into collision, and an act of revenge at the end completes the circle. It is a story of troubled youth, dissatisfaction, and the alienating effect of urban life.", 'title': 'Rebels of the Neon God'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Journey to the West () is a 2014 French-Taiwanese film directed by Tsai Ming-liang. The title is inspired by the 16th century Chinese literary classic of the same name. It had its world premiere at the "Panorama" section of the 64th Berlin International Film Festival in February 2014. It is an entry in Tsai\'s "Walker series" of films.', 'title': 'Journey to the West (2014 film)'}
