 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Tsai Ming-liang () (born 27 October 1957) is a Taiwanese filmmaker. He has written and directed 10 feature films and has also directed many short films and television films. Tsai is one of the most celebrated "Second New Wave" film directors of Taiwanese cinema. His films have been acclaimed worldwide and have won numerous film festival awards. Tsai is considered to be an auteur.', 'title': 'Tsai Ming-liang'}
