 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Vive L'Amour is a 1994 Taiwanese New Wave film by Tsai Ming-liang. It is Tsai's second feature film and premiered in the 51st Venice International Film Festival, where it won the prestigious Golden Lion. The film features striking images and sparse dialogue on urban alienation and loneliness, with three main characters unknowingly sharing an apartment in Taipei.", 'title': "Vive L'Amour"}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "The British League Riders Championship was an individual motorcycle speedway contest between the top riders (or two riders) with the highest average from each club competing in the British League in the UK, or the top division of the league during the period when it had two or more divisions. Similar tournaments had been held before the formation of the British League in 1965, including the Provincial League Riders' Championship, open to riders from the Provincial League. The championship has been sponsored by Player's No 10, Skol, Leyland Cars, Gauntlet, Daily Mirror, TNT Sameday and Dunlop", 'title': "British League Riders' Championship"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Ray P. Dinsmore was an internationally recognized rubber scientist, known for pioneering the use of rayon as a reinforcing material in auto tires. In 1928, Dinsmore patented the first water-emulsion synthetic rubber in the United States. The material later became a staple of the rubber industry during the World War II shortage of natural rubber. Dinsmore worked for the Goodyear Tire and Rubber Company and developed Chemigum, an early synthetic rubber. Dinsmore served as Chairman of the Rubber Division of the American Chemical Society in 1927. He received the 1947 Colwyn medal and was named the 1955 Charles Goodyear Medalist.', 'title': 'Ray P. Dinsmore'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Goodyear Dunlop Tires Operations, S. A. v. Brown, 564 U.S. 915 (2011) , was a United States Supreme Court case in which the Court held that the connection between Goodyear and its subsidiaries with the state of North Carolina was not strong enough to establish general personal jurisdiction over the companies. Two 13-year-old boys from North Carolina died as a result of a bus accident outside of Paris. The parents of the boys believed the accident was due to a defective tire manufactured by a foreign subsidiary of Goodyear Tire and Rubber Company and sued for damages in a North Carolina state court. The foreign subsidiaries asserted that the North Carolina courts lacked jurisdiction over them and moved to dismiss. The North Carolina trial court denied the motion and the North Carolina Court of Appeals affirmed. The Supreme Court reversed, holding that the foreign subsidiaries lacked a significant connection to North Carolina to warrant general personal jurisdiction.', 'title': 'Goodyear Dunlop Tires Operations, S.A. v. Brown'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Dunlop is a brand of tyres owned by various companies around the world. Founded by pneumatic tyre pioneer John Boyd Dunlop in Birmingham, England in 1889, it is owned and operated by Goodyear Tire and Rubber Company in North America, Europe, Australia and New Zealand. In India the brand is owned by Dunlop India Ltd. whose parent company is the Ruia Group. In Asia (Japan, China, Indonesia, Thailand and Russia), Africa and Latin America (except Mexico) by Sumitomo Rubber Industries.', 'title': 'Dunlop Tyres'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The British League Division Two Riders Championship was a speedway contest between the top riders (or two riders) with the highest average points total from each club competing in the British League Division Two in the UK. The championship was inaugurated in 1968 when it was known as the British League Division Two Riders Championship. The competition was held at Hackney between 1968 and 1971, then it was moved to Wimbledon and held there between 1972 and 1984. The event was sponsored by Gauloises in 1976.', 'title': 'British League Division Two Riders Championship'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Kelly-Springfield Tire Company was an American manufacturer of tires for motor vehicles, it was founded in Springfield, Ohio by Edwin Kelly and Arthur Grant in 1894. It was acquired in 1935 by the Goodyear Tire and Rubber Company, who maintained it as a subsidiary until 1999, when its was integrated into Goodyear North America. It continues today as a major brand under Goodyear.', 'title': 'The Kelly Springfield Tire Company'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Douglas Tires are manufactured by Goodyear Tire and Rubber Company for Walmart only. Goodyear and Walmart started Douglas tire in 1992. Douglas tires are in many ways comparable to Kelly tires. As a private label tire, they are less expensive than actual brand-name tires. The down side to Douglas tires are more likely to have manufacturer defects compared to a Goodyear.', 'title': 'Douglas Tires'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Goodyear Inflatoplane was an inflatable experimental aircraft made by the Goodyear Aircraft Company, a subsidiary of Goodyear Tire and Rubber Company, well known for the Goodyear blimp. Although it seemed an improbable project, the finished aircraft proved to be capable of meeting its design objectives, although its sponsor, the United States Army, ultimately cancelled the project when it could not find a "valid military use for an aircraft that could be brought down by a well-aimed bow and arrow".', 'title': 'Goodyear Inflatoplane'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'F.A. Seiberling (October 6, 1859 – August 11, 1955) was an American inventor and founder. He is most famous for co-founding the Goodyear Tire & Rubber Company in 1898 and the Seiberling Rubber Company in 1921. He also built Stan Hywet Hall, a Tudor Revival mansion, now a National Historic Landmark and historic house museum in Akron, Ohio.', 'title': 'Frank Seiberling'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The Provincial League Riders Championship was a contest between the top riders (or two riders) with the highest average points total from each speedway club competing in the Provincial League in the UK, held in each year that the league existed - between 1960 and 1964. The competition was superseded by the British League Riders' Championship in 1965 when the Provincial League merged with the National League to form the British League.", 'title': "Provincial League Riders' Championship"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Kempsville High School is one of eleven public high schools in the Virginia Beach City Public Schools system. It is a comprehensive high school for students in grades 9-12. Located in the western section of the city, the Kempsville High School covers approximately 12 sq. miles, and draws students from both Kempsville Middle School and Larkspur Middle School. In the Fall of 2016, Kempsville High School will be home to the Virginia Beach City Public Schools newest academy program, The Entrepreneurship and Business Academy at Kempsville High School. Students from across the school division can apply to attend this new academy program. A normal school day at Kempsville High is organized into an A/B block schedule with four class periods. Semester courses earn one-half credit, and year courses earn one credit upon successful completion of the course. All students at Kempsville High School have the opportunity to earn dual enrollment credit through Tidewater Community College, attend the Governor’s Magnet School for the Arts, attend the Technical and Career Education Center, attend the Advanced Technology Center, and the evening credit program at Renaissance Academy.The school mission statement is “Kempsville High School is committed to equipping students to be independent, responsible, academically proficient, technically and globally literate critical and creative thinkers."', 'title': 'Kempsville High School'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Toms River High School North is a four-year comprehensive public high school, and was the second public high school established in Toms River, in Ocean County, New Jersey, United States, operating as part of the Toms River Regional Schools. The school opened in 1969 when the original high school (now called Toms River High School South) was found to be too small to accommodate the fast-growing community. However, the first class to graduate wasn't until 1971, since all of the seniors were kept at TRHSS for the class of 1970. Toms River High School North is the largest of all schools in the Toms River Regional School district. The TRHSN mascot is the Mariner, and the school colors are navy blue and gold. The other high schools in the district are Toms River High School East and Toms River High School South.", 'title': 'Toms River High School North'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Shaker Heights High School is a public high school located in Shaker Heights, Ohio, a suburb of Cleveland. The high school is the only public high school in the Shaker Heights City School District, which serves Shaker Heights and a small part of Cleveland. Shaker Heights High School is an International Baccalaureate World School, the only public high school in Cuyahoga County to hold this accreditation and offer rigorous IB classes. It is consistently ranked among the top districts in the state for National Merit semifinalists.', 'title': 'Shaker Heights High School'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Oakdale is a hamlet (and census-designated place) in Suffolk County, New York, United States. The population was 7,974 at the 2010 census. Oakdale is in the Town of Islip.', 'title': 'Oakdale, New York'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Morris High School was a high school in the borough of the Bronx in New York City. It was built in 1897. It was the first high school built in the Bronx. Originally named Peter Cooper High School, the name was changed to Morris High School to commemorate a famous Bronx landowner, Gouverneur Morris, one of the signers of the United States Constitution and credited as author of its Preamble. Morris High School was one of the original New York City Public High Schools created by the New York City school reform act of 1896. In 1983, the school and surrounding area was listed on the National Register of Historic Places as the Morris High School Historic District.', 'title': 'Morris High School (Bronx)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Oahu Interscholastic Association (OIA) is an athletic conference composed of all public secondary schools on the island of Oahu, Hawaii, U.S.A. The OIA was first founded in 1940 as the Rural Oahu Interscholastic Association (ROIA). The five founding schools were Castle High School, Kahuku High School, Leilehua High School, Waialua High & Intermediate School and Waipahu High School. The OIA originally comprised all the rural schools on Oahu, which were all of the schools that were not situated in the main city of Honolulu. This changed however in 1970 with the addition of the five former public school members of the Interscholastic League of Honolulu - Farrington High School, Kaimuki High School, McKinley High School, Roosevelt High School and Kalani High School. After the public Honolulu schools joined, the league changed its identity from the ROIA to simply OIA to reflect the integration of all of the public high schools on the island.', 'title': 'Oahu Interscholastic Association'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Cherry Hill High School East (also known as Cherry Hill East or CHE) is a four-year comprehensive public high school serving students in ninth through twelfth grades in Cherry Hill, in Camden County, New Jersey, United States, operating as part of the Cherry Hill Public Schools. The school opened in 1967 as the township's second high school; what then became known as Cherry Hill High School West was the first public high school in Cherry Hill. The first class graduated in June 1970, having started their freshman year in the Fall of 1966 in the West building doing split sessions until the East building was ready for occupancy in January 1967. The class of 1970 was the only class in the new building until the class of 1971 arrived in Fall 1967. By Fall 1969, the building housed all four grades. The school is one of three high schools in the district; the others are Cherry Hill High School West and Cherry Hill Alternative High School.", 'title': 'Cherry Hill High School East'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Harwich High School was a public high school located in Harwich, Massachusetts. Harwich High School was the third smallest public high school on Cape Cod. Harwich High School closed in 2013-2014 due to the towns of Harwich and Chatham deciding to regionalize their school districts and build a regional high school. The new high school's name will be Monomoy Regional High School.", 'title': 'Harwich High School'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Nashua High School South, formerly Nashua High School, is a public high school located in Nashua, New Hampshire. The school's current location was erected in 1975 with its first class graduating in June 1976. The school was remodeled between 2002 and 2004 when a second school, Nashua High School North, was built. The existing high school building was renamed Nashua High School South. The school serves approximately 2200 students, making it the largest public high school in New Hampshire, and the second largest high school overall, after the private Pinkerton Academy.", 'title': 'Nashua High School South'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Connetquot High School (CHS) is a public high school serving students from the communities of Bohemia, Sayville, West Sayville, Oakdale and Ronkonkoma in the ninth through twelfth grades located in Bohemia, New York and is part of the Connetquot Central School District.', 'title': 'Connetquot High School'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Pasco Intermodal Train Station is a train station on the Amtrak\'s "Empire Builder" line in Pasco, Washington, USA. The station stop serves the Tri-Cities of Richland, Pasco, and Kennewick. The station and parking are owned by the City of Pasco. The track and platforms are owned by BNSF Railway. Greyhound Lines provides inter-city bus transport at the station. Pasco is also a change point for Amtrak engineers on the "Empire Builder".', 'title': 'Pasco Intermodal Train Station'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Castleton Subdivision is a railroad line owned and operated by CSX Transportation in the U.S. state of New York. The line runs from Schodack northwest to Selkirk along a former New York Central Railroad line. At its southeast end, it junctions with the Berkshire Subdivision and Schodack Subdivision. After crossing the Hudson River on the Alfred H. Smith Memorial Bridge, it meets the River Subdivision and Port Subdivision at Selkirk and ends at Selkirk Yard, where the Selkirk Subdivision begins.', 'title': 'Castleton Subdivision'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "The Columbia River Subdivision or Columbia River Sub is a railway line running about 167 mi from Wenatchee to Spokane, Washington. It is operated by BNSF Railway as part of their Northern Transcon. The original line (built in 1893) was built as part of James J. Hill's Great Northern Railway transcontinental railway line.", 'title': 'Columbia River Subdivision'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Nashville Terminal Subdivision is a railroad line owned by CSX Transportation in the U.S. State of Tennessee. The Subdivision is broken up into 5 sections all in Nashville, Tennessee. The northern part of the Terminal is in Madison, Tennessee at milepost 000/0BA 174 on the southern end of the Ex-L&N Mainline Subdivision at Monfort. Disptach for the Mainline Sub is known as "LD" which is part of the Cincinnati Division. From here in Madison begins the double track that stays for another 22 miles south to Brentwood, Tennessee. At milepost 000/0BA/00H 176.6, the famous Johnny Cash "Amqui" location where the Ex-L&N Evansville, Indiana line, the Henderson Subdivision meets with the Terminal. Dispatch for the Henderson Sub is known as "SA" and operates on AAR58. There are two crossings near each other, Williams Ave and Nesbitt Lane at Amqui. From here the Terminal goes south about 2 miles to the Nashville National Cemetery to the first major location, known as Ekin, 000179, where there is a cross over track from number 1 to number 2 track (left to right track). There is also the first EDD (Defect Detector) at 000179.1. Few more miles southward, the next major location appears. At 000181.0, Maplewood is a major location for the Terminal. From here the regular Terminal goes south to swap crews at Kayne Ave, and the right side, Radnor Cutoff, detours the city and gives yard departures and arrivals direct access to and from Radnor yard to cities like Louisville and Chicago. The Cutoff runs from Maplewood to Shelby Park double track. From Shebly the track converges into one to pass the historic Shelby bridge, then it opens back to double track. From there, the cutoff hits the Intermediates at 0BA187.0 known as Chicken Pike. The Radnor Cutoff carries the L&N mainline classification of "0BA" but meets the main at the same milepost from the Terminal. At Chicken Pike, trains are staged to await arrival to Radnor yard. Once they get clearance, speed is decreased to 15, and at 0BA188.1 the EDD (Defect Detector) sounds for departures and arrivals. This location is known as North Radnor. The right track diverging from the #2 is known as A-1, it is for departure trains to Chattanooga and Atlanta. The left track which goes west from the #1 is known as A-2, and serves as a departure track to Memphis, and if the cutoff is out of service, all northbound departures. The interesting piece of Maplewood is the crossovers that are there to move trains from the Cutoff to the Main. Both lines remain double track for a while. The main runs south for 2 more miles until the Intermediate signals at 000183.0. Commonly trains will stop before Delmas Ave when Kayne Ave is at capacity and await dispatch permission before moving south. From here, the main continues south until the CR Cumberland River Swingbridge, where the main converges into a single track shortly to cross the bridge. At this point, trains had been running at track speed of around 40. From the drawbridge into town, speed is reduced to around 10. After the bridge is passed, the main returns to double track in downtown. On the #1 track about a half a mile south, another connecting track is present. This is the Wye track that connects the main with the Bruceton side, while rarely used for mainline trains, locals and river jobs use it. The location is known as 8th Avenue or 8th Avenue Wye. The main then runs down to Kayne Ave, the central hotbed of all Nashville thru traffic. The Memphis, Tennessee Ex-L&N Bruceton Subdivision meets with the Terminal. The Bruceton Sub begins at Church Street at 00N0.0. The line then runs single track until 00N0.7 "11th Avenue" where it turns into double track and also meets the aforementioned, Wye track. The Bruceton line then goes southwest a while to the next signals, at "Shops". Now speed has been increased. The line is still double track until "Sellars", where speed is increased to 40 and jurisdiction transferred to the SD Dispatcher. For a short time, 4 main tracks are present and an additional fifth track for switchers and yard movements. The tracks from left to right in Kayne Ave are as follows: 100, 99, 98, 12, 3. The Kayne Ave yard is also here in this area, which houses some frieght and some switcher engines. The tracks to the old shed are covered and removed. The Union Station is not an active station, but a historic hotel. Crew change usually occurs at the "walkway" which is under the Demombreun St bridge by the Kayne Ave Tower. This is also where the Ex-NC&StL Chattanooga Subdivision begins. Then tracks run south to Fogg St/South End where things get complicated. At milepost 000/0BA/00J187 the 98 track merges into the 12 track, making for 3 tracks now. There is a crossover from 99 to 12, also a crossover from 12 to 3. About 2/10ths of a mile down the 99 merges into the 12 track reducing the tracks back to the regular double. About 4/10ths of a mile down the line from Fogg St, 000187.4, Oak St, is a crossover track from #2 to #1 (the track names are no longer 3 and 12, but are back to regular names). When trains use this crossover northbound, such as Memphis bound trains from the A-2 line, they refer to it as "Long Lead". And now, the Terminal splits into two parts. The right side turns into a single track shortly, and will become the Chattanooga Subdivision, and the left side runs south to Brentwood. The right track runs single shortly until double track for a while. This begins part of the Chattanooga Sub or J-Line. The #2 meets with the A-2 connection track at 00J2.2 known as A-2. Speed is now increased to 40. Commonly northbounds will stage at 4th Ave on the #1 to await clearance. Now about a mile down the #1 meets the A-1 connection line. At 00J3.6 known as A-1. Further down the double track ends at Glencliff (00J4.9). Now it runs single for three miles until it hits Danley, which has the D Line connection track, which is an arrival track for incoming Radnor trains from the J Line. At Danley, the Terminal ends but the same dispatcher handles traffic, "SC". At Oak Street, our main terminal line goes south two miles to 000189.0 known as Criaghead or Vine Hill. There is a crossover here from #1 to #2 track. And there is also a connection/delivery track to the Nashville and Eastern Railroad which connects the Tennessee Central Railroad Museum to a major railroad. Trains sometimes stop on the #2 before Craighead if they are waiting to enter Radnor yard. Sometimes trains wait on the #1 at the Berry Road crossing if they await arrival to Kayne Ave. At this point, speed has been increased to 30 from 10. Moving south, the line hits Radnor Yard at 000192. The #2 track meets the E-Line arrival track which most Memphis trains and locals use. The B-Line which meets the #1 track is used for departures out of the C yard and local jobs. At Mayton, 000192.3, the B line meets the #1 track, and there is a crossover track from #2 to #1. Speed is now at 40. 2 miles south, at 000194.0, South Radnor, the next intersection is present. This is where the Radnor A yard meets the main. There is a single departure/arrival track that meets the #2 track along with a crossover from #1 to #2 track. Commonly, the #2 track south of the signals is used to halt trains. This location is known as TVA, because of the power station that is adjacent. From here the Terminal runs about 2.5 miles south until we hit the southern tip. The tracks converge onto one single main, at 000/0BA196.6 known as Brentwood. Speed is increased to 50 and jurisdiction to the S.E. dispatcher. The right track is the main, S&NA North, while the left track is the Nashville Subdivision which runs to Columbia and exchanges freight with the TSRR. The Nashville Terminal Subdivision is one of the busiest locations on the CSX network, and one of the most important.', 'title': 'Nashville Terminal Subdivision'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Alleghany Subdivision is a railroad line owned by CSX Transportation in the U.S. states of Virginia and West Virginia. It was formerly part of the CSX Huntington East Division. It become part of the CSX Florence Division on June 20, 2016. The line runs from Clifton Forge, Virginia to Hinton, West Virginia for a total of 78.6 miles. At its north end it continues south from the James River Subdivision and at its south end it continues south as the New River Subdivision.', 'title': 'Alleghany Subdivision'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Wishram is a train station in Wishram, Washington served by Amtrak\'s "Empire Builder" line. The station consists of a platform adjacent to a modern, pre-fabricated building that contains BNSF offices. Although Wishram is one of the smallest communities served by Amtrak, it is an important gateway to the scenic recreational opportunities offered by the Columbia River.', 'title': 'Wishram station'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'James Jerome Hill (September 16, 1838 – May 29, 1916), was a Canadian-American railroad executive. He was the chief executive officer of a family of lines headed by the Great Northern Railway, which served a substantial area of the Upper Midwest, the northern Great Plains, and Pacific Northwest. Because of the size of this region and the economic dominance exerted by the Hill lines, Hill became known during his lifetime as "The Empire Builder."', 'title': 'James J. Hill'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Chicago and Milwaukee Subdivision (commonly referred to as the C&M Subdivision or C&M Sub) is a railway line running between Chicago, Illinois and Milwaukee, Wisconsin. It is operated by Canadian Pacific Railway through its primary United States subsidiary, the Soo Line Railroad. This had previously been owned by the Chicago, Milwaukee, St. Paul and Pacific Railroad, commonly known as the Milwaukee Road. It carries Amtrak\'s "Empire Builder" and "Hiawatha Service", as well as commuter trains operated on part of Metra\'s Milwaukee District/North Line into Chicago. The Union Pacific Railroad operates their Milwaukee Subdivision, a former Chicago and North Western line, parallel to this route just to the east.', 'title': 'C&amp;M Subdivision'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Swanson is a settlement and unincorporated place in the Unorganized North Part of Algoma District, northeastern Ontario, Canada. It lies at the south end of Esnagi Lake on the Magpie River where the Canadian Pacific Railway transcontinental main line crosses the river, between the settlements of Ryerson on the line 14 km to the west and Franz, the junction of the CPR with the Algoma Central Railway, 9 km to the east. Canadian Pacific Railway has built, operates and maintains a signalled siding at Swanson as part of their White River Subdivision. The signals and switches at Swanson and other signalled siding locations on the White River Subdivision are under Centralized Traffic Control (CTC), a train control system operated by a Rail Traffic Controller situated in the Canadian Pacific Railway headquarters in Calgary, Alberta. Via Rail provides passenger train services with the Sudbury – White River train.', 'title': 'Swanson, Ontario'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The East Junction Branch is a railroad line owned and operated by the Providence and Worcester Railroad in the U.S. state of Rhode Island and by the Massachusetts Bay Transportation Authority in Massachusetts. The line runs from the P&W's East Providence Branch in East Providence, Rhode Island northeast to Amtrak's Shore Line (Northeast Corridor) at East Junction in Attleboro, Massachusetts along a former New York, New Haven and Hartford Railroad line. In Massachusetts, CSX Transportation operates local freight service via trackage rights, which it also has on the Shore Line north towards Boston. The P&W has overhead trackage rights in Massachusetts over the East Junction Branch, Shore Line, and CSX's Middleboro Subdivision, New Bedford Subdivision, and Fall River Subdivision to the state line in Fall River, to reach its line to Newport, Rhode Island.", 'title': 'East Junction Branch'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Gymnastics was contested at the 2002 Asian Games in Busan, South Korea. Artistic gymnastics took place from October 1 to October 5. Rhythmic gymnastics took place on October 8 and 9. All Gymnastics events took place at Sajik Gymnasium.', 'title': 'Gymnastics at the 2002 Asian Games'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Early-April 1957 tornado outbreak sequence was a deadly tornado outbreak sequence that struck most of the Southern United States from April 2–5, 1957. The outbreak killed at least 21 people across three states and produced at least 72 tornadoes from Texas to Virginia. The outbreak was most notable due to a tornado that hit a densely populated area of the Dallas–Fort Worth metropolitan area, killing 10 people and injuring 200 or more. The tornado, highly visible for most of its path, was at the time the most observed and best-documented tornado in recorded history; hundreds of people photographed or filmed the F3 tornado as it moved just west of Downtown Dallas. The film of this tornado is still known for its unusually high quality and sharpness, considering the photography techniques and technology of the 1950s. Damage from the Dallas tornado reached as high as $4 million (1957 USD). Besides the famous Dallas tornado, other deadly tornadoes struck portions of Mississippi, Texas, and Oklahoma. Two F4 tornadoes struck southern Oklahoma on April 2, killing five people. Three other significant, F2-rated tornadoes that day killed two people in Texas and one more in Oklahoma. An F3 tornado struck rural Mississippi on April 4, killing one more person. In addition to confirmed tornadoes, a possible tornado hit Ballard County, Kentucky, on April 3, unroofing homes, destroying a drive-in theater, and uprooting trees. A loud roaring noise was heard. Two other brief tornadoes may have hit near Westlake and at Tallulah, Louisiana, late on April 4.', 'title': 'Early-April 1957 tornado outbreak sequence'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "The Oikos University shooting occurred on April 2, 2012, when a gunman shot at people inside Oikos University, a Korean Christian college in Oakland, California, United States. Within a few hours, the number of reported fatalities reached seven. 43-year-old One L. Goh, a former student at the school, was taken into custody and identified as the suspect in the shootings. Along with the California State University, Fullerton massacre, this was the fourth-deadliest university shooting in United States history, after the Virginia Tech massacre, the University of Texas Clock Tower shooting, and the Umpqua Community College shooting, and the eighth-deadliest U.S. school massacre overall. It is also considered the deadliest mass killing in the city's history.", 'title': 'Oikos University shooting'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Tezno massacre (Croatian: "Pokolj u Teznom" ) was the mass killing of POWs of the Independent State of Croatia (NDH) that took place in Tezno near Maribor, after the end of World War II in Yugoslavia. The killings were perpetrated by units of the Yugoslav Partisans in May 1945, following the Bleiburg repatriations. Summary executions began on 19 May when first prisoners arrived to the Tezno forest from nearby prison camps and continued until 26 May. Most of the bodies were buried in a several kilometers long antitank trench, which the Yugoslav authorities concealed and kept secret.', 'title': 'Tezno massacre'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "The 1972 American League Championship Series took place between October 7 and 12, 1972. The Oakland Athletics (93–62 on the season) played the Detroit Tigers (86–70 on the season) for the right to go to the 1972 World Series, with the A's coming out on top in the five-game series, 3–2. Games 1 and 2 took place at the Oakland Coliseum, and 3 through 5 took place at Tiger Stadium.", 'title': '1972 American League Championship Series'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Founded in 2012 by Scott Cross, Sean Cross, Eduardo Sanchez-Navarro Redo, Alfonso Pasquel, Juan Gallardo Thurlow, Eduardo Sanchez-Navarro Rivera Torres, and Pablo Sanchez-Navarro, the Los Cabos International Film Festival is an international film festival that takes place annually in mid-November in Los Cabos, Mexico. The 2012 Los Cabos International Film Festival (formerly Baja International Film Festival) took place November 14–17 in Los Cabos, Mexico. The 2013 Los Cabos International Film Festival took place November 13–16 in Cabo San Lucas, Mexico. The 2014 Los Cabos International Film Festival took place November 12–16, 2014 in Los Cabos, Mexico. The 2015 Los Cabos International Film Festival took place November 11–15, 2015 in Los Cabos, Mexico. The 2016 Los Cabos International Film Festival took place November 9–13, 2016 in Los Cabos, Mexico. The 2017 festival will take place November 8-12, 2017. Held in one of Mexico's premier resort destinations, the festival draws attendees and filmmakers from across Mexico, the United States and around the world.", 'title': 'Los Cabos International Film Festival'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Račak massacre ()) or Račak operation (Serbian: Акција Рачак/Akcija Račak ) was the mass killing of 45 Kosovo Albanians that took place in the village of Račak () in central Kosovo in January 1999. The killings were perpetrated by Serbian security forces. The Serbian government refused to let a war crimes prosecutor visit the site, and maintained that the casualties were all members of the rebel Kosovo Liberation Army killed in combat with state security forces.', 'title': 'Račak massacre'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "The Umpqua Community College shooting occurred on October 1, 2015, at the UCC campus near Roseburg, Oregon, United States. Chris Harper-Mercer, a 26-year-old enrolled at the school, fatally shot an assistant professor and eight students in a classroom. Seven to nine others were injured. Roseburg police detectives responding to the incident engaged Harper-Mercer in a brief shootout. After being wounded, he killed himself by shooting himself in the head. The mass shooting was the deadliest in Oregon's modern history.", 'title': 'Umpqua Community College shooting'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 2007 Mosul massacre was a mass killing that took place on April 23, 2007 in Mosul, in northern Iraq. A bus carrying workers from the Mosul Textile Factory was hijacked by unidentified attackers. The attackers checked the passengers' identity cards, telling Muslims and Christians to get off the bus. They then drove the bus to eastern Mosul with 23 remaining passengers, all Yazidis, where the hostages were made to lie face down in front of a wall and shot.", 'title': 'April 2007 Mosul massacre'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Robinson Ekspeditionen 2008 (also known as Robinson: Fans vs. Paradise) was the eleventh season of the Danish versions of the Swedish show "Expedition Robinson". This season premiered on September 1, 2008 and aired until November 24, 2008. The main twist this season was that every contestant was either a fan of Robinson or was a former contestant on the show "Paradise Hotel". The fan tribe was called "Tenga", while the Paradise tribe was called "Sembilang". There were many additional twists this season, the first taking place in episode 1 when all of the contestants were made to take part in an elimination challenge. Mirja Østergaard lost the challenge and was immediately eliminated. The next twist took place in episode 2 when Jan Novaa, who had been voted out in episode one, returned to the game. The next twist took place in episode 3 when Emil Debski swapped tribes in order to even up the tribe numbers. In episode 4 a larger tribal swap took place in which Jan Novaa, Mads Jensen, and Michelle Jensen swapped from the Sembilang tribe to the Tenga tribe and Emil Debski, Hilde Austad, Martin Persson, Chiro "Sido" Kiarie swapped from the Tenga tribe to the Sembilang tribe. The next twist came in episode 5 when jokers Laila Neilsen and Nick Zitouni entered the game with Laila joining the Sembilang tribe and Nick joining the Tenga tribe. In episode 6 an individual challenge took place in which the winner would be allowed to eliminate a player from the opposing tribe. Haider Mohamad won the challenge and chose to eliminate Sheila Nymann. Immediately following the merge in episode 7, Haider won the same type of challenge and chose to eliminate Karina Strunge from the game. The next twist came in episode 10 when contestant Hilde Austad used the "Talisman" she had to void any votes cast against her in tribal council. This led to the elimination of Laila Neilsen who had the second most votes. When it came time for the final four, the remaining contestants competed in two challenges. The winners of these challenges would earn the right to eliminate one of the losers. Emil won the first challenge and chose to eliminate Martin and Daniela won the second challenge and chose to eliminate Emil. Ultimately, it was Daniela Hansen from Paradise Hotel 2006 who won the season over Robinson fan Hilde Austad by a tiebreaking cointoss after the jury vote ended in a 4-4 tie.', 'title': 'Robinson Ekspeditionen 2008'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Neil Ellwood Peart, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} ( ; born September 12, 1952), is a Canadian-American musician and author, best known as the drummer and primary lyricist for the rock band Rush. Peart has received numerous awards for his musical performances, including an induction into the "Modern Drummer" Hall of Fame in 1983, making him the youngest person ever so honored. He is known for his technical proficiency and stamina.', 'title': 'Neil Peart'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Peter Edward "Ginger" Baker (born 19 August 1939) is an English drummer, best known as the founder of the rock band Cream. Baker\'s work in the 1960s earned him praise as "rock\'s first superstar drummer", although his individual style melded a jazz background with his interest in African rhythms. Baker is an inductee of the Rock and Roll Hall of Fame as a member of Cream and is widely considered one of the most influential drummers of all time, recognised by his induction into the "Modern Drummer" Hall of Fame in 2008, and his induction into the Classic Drummer Hall of Fame in 2016. Baker is credited as a pioneer of drumming in genres like jazz fusion, heavy metal and world music.', 'title': 'Ginger Baker'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Stewart Armstrong Copeland (born July 16, 1952) is an American musician and composer, best known as the former drummer for the English rock band the Police, and for his film and video game soundtracks. Copeland has also written various pieces of music for ballet, opera and orchestra. According to MusicRadar, Copeland’s "distinctive drum sound and uniqueness of style has made him one of the most popular drummers to ever get behind a drumset". He was inducted into the Rock and Roll Hall of Fame as a member of the Police in 2003, the "Modern Drummer" Hall of Fame in 2005, and the "Classic Drummer" Hall of Fame in 2013. In 2016, Copeland was ranked 10th on "Rolling Stone"\' s "100 Greatest Drummers of All Time".', 'title': 'Stewart Copeland'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': '"Nobody\'s Hero" is a song by Canadian progressive rock band Rush, released as the third single from their 1993 album "Counterparts". The first stanza deals with the AIDS-related death of a homosexual man named Ellis, a friend of Neil Peart when Peart lived in London. After the chorus, the second stanza speaks of a girl who was murdered in Peart\'s hometown, Port Dalhousie. The girl is rumoured to have been Kristen French, one of Paul Bernardo\'s victims.', 'title': "Nobody's Hero"}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Keith John Moon (23 August 1946 \xa0– 7 September 1978) was an English drummer who played with the English rock band the Who. He was noted for his unique style and his eccentric, often self-destructive behaviour. His drumming continues to be praised by critics and musicians. He was posthumously inducted into the "Modern Drummer" Hall of Fame in 1982, becoming only the second rock drummer to be chosen, and in 2011, Moon was voted the second-greatest drummer in history by a "Rolling Stone" readers\' poll.', 'title': 'Keith Moon'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Michael Stephen Portnoy (born April 20, 1967) is an American drummer primarily known as the former drummer, backing vocalist, and a co-founder of the progressive metal/rock band Dream Theater. Known for his technical skill as a drummer, Portnoy has won 30 awards from the "Modern Drummer" magazine. He co-produced six Dream Theater albums with guitarist John Petrucci, starting from "" through "Black Clouds and Silver Linings". From "A Change of Seasons" onwards, Portnoy had been writing a significant amount of Dream Theater\'s lyrics. He is the second youngest person (after Neil Peart) to be inducted into the "Modern Drummer\'s" "Hall of Fame", at 37 years of age.', 'title': 'Mike Portnoy'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Hollowick is a Canadian rock band from Oshawa, formerly called Rides Again. It is composed of lead singer and guitarist Nathan Peyton, bassist and brother background vocalist Chad Peyton, lead guitarist Luke LeDoux, and drummer Frank Goerz. Their first full-length album, "Into Existence", was released as Rides Again on 2 October 2007. The first single, "Wonder Why", was produced by Gavin Brown (known for producing other Canadian bands including Billy Talent and Three Days Grace). Videos and singles followed for Infected and It\'s Too Late, which received play on MuchMoreMusic. "Infected" became a top 10 modern rock hit in Canada. The band has toured with Theory of a Deadman, Social Code, The Trews and Hedley, Yellowcard among others. A few years before "Into the Existence", Rides Again was known for their hit song "Geeze Louise", a pop rock song popular among young teens. The band was incorporated with Vodoo Records at this time, playing across southern Ontario. At this time the original drummer and cousin of Nathan and Chad, Bradley Christiansen, was in the band, but had left later on to pursue other career options. 2007 seemed to be the year for the striving Canadian band having their music videos published on Much Music, and Much More Music as well as radio stations across Canada. In mid-2009, Mike McElroy resigned as Rides Again drummer to pursue other importances. After Mike left they asked drummer and musician Kelly Voelkel to join the band, Kelly performed all of the drums and percussion on Hollowick\'s upcoming album. In July 2009 Kelly left to pursue more professional endeavours. Friend Anthony Moreino and former Rides Again merchandise guy filled in on drums for a short time for Hollowick, until new drummer Frank Goerz was found. With Goerz now behind the drum kit, there\'s a new level of explosive energy never felt before for Hollowick.', 'title': 'Hollowick'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Jeffrey Thomas Porcaro (April 1, 1954 – August 5, 1992) was an American drummer, songwriter, and record producer. In a career that spanned more than 20 years, Porcaro was best known for his work with the rock band Toto. Porcaro is one of the most recorded session musicians in history, working on hundreds of albums and thousands of sessions. While already an established studio player in the 1970s, he came to prominence in the United States as the drummer on the Steely Dan album "Katy Lied". AllMusic has characterized him as "arguably the most highly regarded studio drummer in rock from the mid-\'70s to the early \'90s", further stating that "It is no exaggeration to say that the sound of mainstream pop/rock drumming in the 1980s was, to a large extent, the sound of Jeff Porcaro." He was posthumously inducted into the "Modern Drummer" Hall of Fame in 1993.', 'title': 'Jeff Porcaro'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Steven Bruce "Steve" Smith (born August 21, 1954) is an American drummer best known as a member of the rock band Journey, rejoining the group for the third time in 2015. " Modern Drummer" magazine readers have voted him the #1 All-Around Drummer five years in a row. In 2001, the publication named Smith one of the Top 25 Drummers of All Time, and in 2002 he was voted into the Modern Drummer Hall of Fame. He was inducted into the Rock and Roll Hall of Fame as a member of Journey on April 7, 2017.', 'title': 'Steve Smith (musician)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Carmine Appice (born December 15, 1946) is an American drummer and percussionist most commonly associated with the rock genre of music. He has received classical music training, and was influenced early-on by the work of jazz drummers Buddy Rich and Gene Krupa. Appice is best known for his associations with Vanilla Fudge, Cactus, the power trio Beck, Bogert & Appice, Rod Stewart, King Kobra, and Blue Murder, which also featured John Sykes of Whitesnake and Thin Lizzy fame, and Tony Franklin of The Firm. He was inducted into the "Classic Drummer" Hall of Fame in 2013, and the "Modern Drummer" Hall of Fame in 2014.', 'title': 'Carmine Appice'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Burgtheater is a 1936 Austrian drama film directed by Willi Forst. Most of the film was shot in the Burgtheater in Vienna.', 'title': 'Burgtheater (film)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Willi Forst, born Wilhelm Anton Frohs (7 April 1903 – 11 August 1980) was an Austrian actor, screenwriter, film director, film producer and singer. As a debonair actor he was a darling of the German-speaking film audiences, as a director, one of the most significant makers of the Viennese period musical melodramas and comedies of the 1930s known as "Wiener Filme". From the mid-1930s he also recorded many records, largely of sentimental Viennese songs, for the Odeon Records label owned by Carl Lindström AG.', 'title': 'Willi Forst'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Viennese Girls (German:Wiener Mädeln) is a 1945 historical musical film directed by Willi Forst and starring Forst, Anton Edthofer and Judith Holzmeister. The film was made by Wien-Film, a Vienna-based company set up after Austria had been incorporated into Greater Germany following the 1938 Anschluss. It was the third film in Forst\'s "Viennese Trilogy" which also included "Operetta" (1940) and "Vienna Blood" (1942). The film was finished in 1945, during the closing days of the Second World War. This led to severe delays in its release, which eventually took place in 1949 in two separate versions. One was released by the Soviet-backed Sovexport in the Eastern Bloc and the other by Forst.', 'title': 'Viennese Girls'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Gently My Songs Entreat (German: Leise flehen meine Lieder ) is a 1933 Austrian-German musical film directed by Willi Forst and starring Marta Eggerth, Luise Ullrich and Hans Jaray. Art direction was by Julius von Borsody. The film is a biopic of the composer Franz Schubert (1797–1828). It was Forst\'s directorial debut. A British version was made called "Unfinished Symphony". The German title refers to the first line of the Lied "Ständchen" (Serenade) from Schubert\'s collection "Schwanengesang", "the most famous serenade in the world", which Eggerth performs in the film.', 'title': 'Gently My Songs Entreat'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Prince of Arcadia (German: Der Prinz von Arkadien) is a 1932 Austrian-German romance film directed by Karl Hartl and starring Willi Forst, Liane Haid and Hedwig Bleibtreu. It premiered on 18 May 1932.', 'title': 'The Prince of Arcadia'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "A Student's Song of Heidelberg (German:Ein Burschenlied aus Heidelberg) is a 1930 German musical film directed by Karl Hartl and starring Hans Brausewetter, Betty Bird and Willi Forst. It marked Hartl's directoral debut. The film is in the tradition of the nostalgic Old Heidelberg.", 'title': "A Student's Song of Heidelberg"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Operetta (German: Operette) is a 1940 musical film directed by Willi Forst and starring Forst, Maria Holst and Dora Komar. The film was made by Wien-Film, a Vienna-based company set up after Austria had been incorporated into Greater Germany following the 1938 Anschluss. It is the first film in director Willi Forst\'s "Viennese Trilogy" followed by "Vienna Blood" (1942) and "Viennese Girls" (1945). The film portrays the life of Franz Jauner (1832–1900), a leading musical figure in the city. It is both an operetta film and a Wiener Film.', 'title': 'Operetta (film)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Elmer Clifton (March 14, 1890 – October 15, 1949) was an American writer, director and actor from the early silent days. A collaborator of D.W. Griffith, he appeared in "The Birth of a Nation" (1915) and "Intolerance" (1916) before giving up acting in 1917 to concentrate on work behind the camera, with Griffith and Joseph Henabery as his mentors. His first feature-length solo effort as a director was "The Flame of Youth" with Jack Mulhall.', 'title': 'Elmer Clifton'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Kaiserjäger is a 1956 Austrian film directed by Willi Forst.', 'title': 'Kaiserjäger (film)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Miracles Still Happen (German: Es geschehen noch Wunder) is a 1951 West German romantic comedy film directed by Willi Forst and starring Forst, Hildegard Knef and Marianne Wischmann. It was intended by Forst as a more harmless follow-up to his controversial "Die Sünderin" which had also starred Knef.', 'title': 'Miracles Still Happen (1951 film)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Philip Andrew Irons (July 24, 1978November 2, 2010) was an American professional surfer. Irons learned to surf on the dangerous and shallow reefs of the North Shore in Kauai, Hawaii. Over the course of his professional career, he won three world titles (2002, 2003, 2004), three Quiksilver Pro France titles (2003, 2004, 2005), two Rip Curl Pro Search titles (2006 and 2007) and 20 elite tour victories including the Vans Triple Crown of Surfing four times from 2002-2006. On September 3, 2010 he won the Billabong Pro Teahupoo in Tahiti. He and his family hosted the Annual Irons Brothers Pinetrees Classic, a contest for youngsters. The Governor of Hawaii declared February 13 forever "Andy Irons Day". He is the only surfer to have won a title at every venue on the ASP calendar.', 'title': 'Andy Irons'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Dana Brown (born December 11, 1959 in Dana Point, California) is an American surfer and filmmaker, and is the oldest son of filmmaker Bruce Brown. His films include "The Endless Summer Revisited" (2000) which is made up of unused footage from "The Endless Summer" (1964) and "The Endless Summer II" (1994), as well as some original interviews with the stars of those films. His first all-original film was "Step Into Liquid" (2003) followed by a documentary on the Baja 1000 titled "Dust to Glory" (2005). In 2009, he debuted a new film called "Highwater" during the 100th anniversary of the Santa Monica Pier; the film follows life on the North Shore and the surfers who compete in the Vans Triple Crown of Surfing. In 2014, the movie "On Any Sunday, The Next Chapter" continues the saga of motocross documentaries which began with the 1972 Academy Award for Documentary Feature nominated film "On Any Sunday" (1971).', 'title': 'Dana Brown'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Reef Hawaiian Pro is a surfing event held annually on the North Shore, Oahu, Hawaii. It is currently the first leg of the Triple Crown of Surfing. Surfers compete for a share of $135,000 (men) or $35,000 (women) prize money. Since it carries a 6-star rating, the event is critical for those who want to qualify for the ASP World Tour.', 'title': 'Reef Hawaiian Pro'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Triple Crown of Acting is a term used in the American entertainment industry to describe actors who have won a competitive Academy Award, Emmy Award, and Tony Award in the acting categories. 23 people have achieved the triple crown of acting (14 women, 9 men). Helen Hayes' Emmy Award win on February 5, 1953, made her the first person to achieve the triple crown. Thomas Mitchell became the first man to achieve the triple crown with his Tony Award win later the same year on March 29, 1953. Hayes and Rita Moreno are the only triple crown winners in competitive acting categories who have also won a Grammy Award to complete the EGOT.", 'title': 'Triple Crown of Acting'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Triple Crown College Baseball League (TCCBL) is a wood bat collegiate summer baseball league based in Fort Collins, Colorado. The TCCBL was founded in 2007 by Triple Crown Sports, a sports event marketing company also based out of Fort Collins, Colorado. Dave King, owner of Triple Crown Sports, was instrumental in founding the league. The league consists of players from all levels of collegiate baseball, from NCAA Division I to NAIA and Junior-college players. The 2009 edition of the league will consist of five teams, the Triple Crown Renegades, Colorado Khaos, Triple Crown Bandits, Triple Crown Bulldogs, and Colorado Aliens.', 'title': 'Triple Crown College Baseball League'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "The Vans Triple Crown of Surfing is a Hawaiian specialty series of professional surfing events, offering three events to men and three events to women. For the men, those events are the Reef Hawaiian Pro at Haleiwa Ali'i Beach Park; the O'Neill World Cup of Surfing at Sunset Beach; and the Billabong Pipeline Masters at the Banzai Pipeline. The women's events are the Vans Hawaiian Pro at Haleiwa Ali'i Beach Park; the Roxy Pro at Sunset Beach; and the Billabong Pro Maui at Honolua Bay, Maui.", 'title': 'Triple Crown of Surfing'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Haleʻ iwa is a North Shore community and census-designated place (CDP) in the Waialua District of the island of Oʻ ahu, City and County of Honolulu.', 'title': 'Haleiwa, Hawaii'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Triple Crown Trophy is a silver trophy awarded to the winner of the United States Triple Crown of Thoroughbred Racing. The Triple Crown trophy has come to represent the pinnacle achievement in horseracing. Commissioned in 1950 by the Thoroughbred Racing Association, artisans at the world-famous Cartier Jewelry Company were charged with creating not just a trophy, but a true work of art. The result was a three-sided vase, each face equally representing the three jewels of the crown, intending to capture the spirit of horseracing's most sought after, and rarest, honor. The three sides are engraved with specific information from each of the three races; the Kentucky Derby, the Preakness Stakes and the Belmont Stakes. Upon completion of the first trophy it was awarded to the 1948 Triple Crown Winner Citation. Each year thereafter, retroactive trophies were presented to the first eight winners of the Triple Crown in reverse order until all of the previous winners or their heirs were awarded.", 'title': 'Triple Crown Trophy'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Offshore Festival was a camp-out rock and alternative music festival held during Easter at a farm near Torquay, Victoria, Australia from the late 1990s to 2001. It was run by the same organisers as the Falls Festival, held at nearby Lorne on New Year's Eve. It interlinked with the Rip Curl Pro surfing event, held at nearby Bells Beach, and festival ticketholders had free admission to the surfing event.", 'title': 'Offshore Festival'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Andrew Joseph "Andy" Finch (born March 20, 1981) is an American snowboarder. His accomplishments include winning the overall U.S. Grand Prix Halfpipe Title in 2003 and 2004, taking first place in the Arctic Challenge in Norway in April 2004, winning the Vans Triple Crown in February 2004, winning the O’Neill Snowboard Jam in January 2005, and finishing in second place in Northstar Resort’s Vans Tahoe Cup. In addition, Finch competed in the 2006 Winter Olympics for the United States. He attended Bullard High School in Fresno, California.', 'title': 'Andy Finch'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Lou Cutell (born October 6, 1930) is an American movie and television actor. He portrayed the proctologist, Dr. Cooperman, in "The Fusilli Jerry" episode of the television series "Seinfeld" and Leo Funkhouser on "Curb Your Enthusiasm". Among cult movie fans, he is best known for his portrayal of Dr. Nadir in "Frankenstein Meets the Space Monster", and he can be briefly seen in "Pee-wee\'s Big Adventure" as Amazing Larry. In 1998, he also played a small role in "The Odd Couple II" as Abe, one of Oscar Madison (Walter Matthau)\'s card-playing friends in Sarasota, Florida. Recently, he was a series regular on the NBC show, "Betty White\'s Off Their Rockers". In 2013, he appeared on the "How I Met Your Mother" episode "Last Time in New York".', 'title': 'Lou Cutell'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"Coming Back" is the second episode of the ninth season of the CBS sitcom "How I Met Your Mother", and the 186th episode overall.', 'title': 'Coming Back (How I Met Your Mother)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Unpause" is the fifteenth episode of the ninth season of the CBS sitcom "How I Met Your Mother", and the 199th episode overall. This is also the episode where Ted\'s future children\'s names are finally revealed; the daughter\'s name is Penny and the son is Luke.', 'title': 'Unpause'}
