 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Vesuvius" is the nineteenth episode of the ninth season of the CBS sitcom "How I Met Your Mother", and the 203rd episode overall. The episode features Ted in 2024, telling the Mother about the day of Robin and Barney\'s wedding. The final scene prompted some to think that the Mother was dead; this was proven correct in the series finale, "Last Forever".', 'title': 'Vesuvius (How I Met Your Mother)'}
