[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Rhinelander Waldo (May 24, 1877 – August 13, 1927) was appointed the seventh New York City Fire Commissioner by Mayor William Jay Gaynor on January 13, 1910. He resigned on May 23, 1911, less than two months after the deadly Triangle Shirtwaist Factory fire to accept an appointment as the eighth New York City Police Commissioner. On December 31, 1913, he was dismissed by the outgoing acting mayor, Ardolph Kline. Among other achievements in office, Waldo contributed to the motorization of both departments.', 'title': 'Rhinelander Waldo'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Joseph E. Spinnato (born October 24, 1938) was appointed Acting Fire Commissioner of the City of New York by Mayor Edward I. Koch on October 22, 1982 upon the resignation of Fire Commissioner Charles J. Hynes, and was appointed the 25th Fire Commissioner on February 17, 1983. He served in that position until his resignation on October 20, 1987. He continues to be active in public life and has held several governmental positions since.', 'title': 'Joseph E. Spinnato'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Michael F. Walsh (February 24, 1894, Brooklyn, Kings County, New York – July 22, 1956, Brooklyn, New York City) was an American lawyer and Democratic politician. His father, Patrick, who emigrated from Ballydine House near Cashel in Ireland's County Tipperary, was the first person to serve simultaneously as the Chief and Fire Commissioner of the New York City Fire Department.", 'title': 'Michael F. Walsh'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Carlos M. Rivera (born 1934) is the first Hispanic commissioner in the New York City Fire Department's 127-year history. He was appointed the 27th Fire Commissioner of the City of New York by Mayor David N. Dinkins on January 1, 1990 and served in that position until his resignation on August 31, 1993.", 'title': 'Carlos M. Rivera'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The Triangle Shirtwaist Factory fire in New York City on March 25, 1911 was the deadliest industrial disaster in the history of the city, and one of the deadliest in US history. The fire caused the deaths of 146 garment workers – 123 women and 23 men – who died from the fire, smoke inhalation, or falling or jumping to their deaths. Most of the victims were recent Italian and Jewish immigrant women aged 16 to 23; of the victims whose ages are known, the oldest victim was Providenza Panno at 43, and the youngest were 14-year-olds Kate Leone and "Sara" Rosaria Maltese.', 'title': 'Triangle Shirtwaist Factory fire'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Joseph H. Johnson, Jr. (June 16, 1871 - March 7, 1942) was New York City Fire Commissioner from 1911 to 1913. He was chief of the New York City Transit Authority. By 1918 he was deputy New York City Comptroller. He served as chief of the New York Public Service Commission in 1921.', 'title': 'Joseph Johnson (FDNY Commissioner)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The New York City Fire Commissioner is the civilian administrator of the New York City Fire Department (FDNY), appointed by the Mayor of the City of New York. There have been 33 commissioners excluding Acting Fire Commissioners, and 38 including Acting Fire Commissioners. This is since Manhattan and the Bronx consolidated with Brooklyn, Queens, and Staten Island to form The City of New York in 1898. The current Fire Commissioner is Daniel A. Nigro, who has held the office since June 7, 2014. The term of office is January 1 to December 31 unless the commissioner is removed from office by the mayor, dies in office, or resigns.', 'title': 'New York City Fire Commissioner'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Salvatore Joseph "Sal" Cassano (born 22 January 1945) served as the 32nd New York City Fire Commissioner. His appointment by New York City Mayor Michael R. Bloomberg to succeed Nicholas Scoppetta was announced on 21 December 2009 and became effective on 1 January 2010. Cassano was sworn in on 11 January 2010. On May 9, 2014, Daniel A. Nigro was announced as Cassano\'s successor as commissioner of the FDNY, in June 2014.', 'title': 'Salvatore Cassano'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Howard Safir (born February 24, 1942) was New York City Fire Commissioner from 1994 to 1996 and New York City Police Commissioner from 1996 to 2000.', 'title': 'Howard Safir'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Thomas Sturgis (1846 - February 25, 1914) was appointed the second New York City Fire Commissioner by Mayor Seth Low on January 1, 1902 and served in that position until the end of the Low Administration on December 31, 1903. Prior to this he served as a fire commissioner under William Lafayette Strong, replacing Austin E. Ford.', 'title': 'Thomas Sturgis'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The White Rose is the third novel in Glen Cook's ongoing series, The Black Company. The series combines elements of epic fantasy and dark fantasy as it follows an elite mercenary unit, The Black Company, through roughly forty years of its approximately four hundred year history.", 'title': 'The White Rose (Cook novel)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Dogs of War is a 1980 war film based upon the 1974 novel of the same name by Frederick Forsyth. Largely filmed in Belize, it was directed by John Irvin and starred Christopher Walken and Tom Berenger. In it a small mercenary unit of soldiers is privately hired to depose the president of a fictional African country so that a British tycoon can gain access to a platinum deposit.', 'title': 'The Dogs of War (film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Daniel Wretström (October 15, 1983-December 9, 2000) was a Swedish ultra-nationalist murdered in Salem, Sweden. He played in the white power rock band Vit Legion (White Legion).', 'title': 'Daniel Wretström'}
