 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Tomaso Schiavo or Thomaso Schiavo di Lebano (Italian: "Tommaso Schiavo" ; "Thomas the Slav"; 1470) was a Venetian Dalmatian captain and mercenary commander that participated in the Ottoman–Venetian War (1463–79). He commanded a mercenary unit numbering 500 men largely recruited from Dalmatia. During the 1470 Ottoman siege of Venetian Negroponte the Venetians uncovered that he had sent envoys to the Ottomans; a deep conspiracy was unearthed and Schiavo\'s associates were arrested. His brother was tortured to death, giving up plans of an Ottoman attack. Schiavo, unknowing, was summoned by Erizzo and then killed.', 'title': 'Tomaso Schiavo'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Mobutu Sese Seko Kuku Ngbendu Wa Za Banga ( ; born Joseph-Désiré Mobutu; 14 October 1930 – 7 September 1997) was the military dictator and President of the Democratic Republic of the Congo (which Mobutu renamed Zaire in 1971) from 1965 to 1997. He also served as Chairperson of the Organisation of African Unity in 1967–1968.', 'title': 'Mobutu Sese Seko'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The White Legion was a mercenary unit during the First Congo War (1996–97) employed on the side of Zaire President Mobutu Sese Seko. This group of several hundred men, mostly from former Yugoslavia, was given the task of defending the city of Kisangani and training Zairian troops. This effort was largely unsuccessful and in mid-March 1997 the mercenaries left the country.', 'title': 'White Legion (Zaire)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Soldiers Live is the ninth novel in Glen Cook's ongoing series, The Black Company. The series combines elements of epic fantasy and dark fantasy as it follows an elite mercenary unit, The Black Company, through roughly forty years of its approximately four hundred year history.", 'title': 'Soldiers Live'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Star Fox is a video game series created by Nintendo. The games follow an independent mercenary unit of anthropomorphic animals called Star Fox, led by chief protagonist Fox McCloud, and their adventures around the Lylat system. The original "Star Fox" (1993) was a forward-scrolling 3D rail shooter, though later titles added more directional freedom. The game\'s concept was inspired by a shrine to the fox deity Inari Ōkami, which Shigeru Miyamoto visited regularly. The shrine was accessible through a series of arches, influencing the gameplay.', 'title': 'Star Fox'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Venom Snake (ヴェノム・スネーク , Venomu Sunēku ) , also known as Punished Snake (パニッシュド・スネーク , Panishudo Sunēku ) , is the protagonist in the 2015 video game "". He is the leader of the mercenary unit Diamond Dogs who returns to the battlefield after waking up from a nine-year coma in an incident that also resulted in the loss of his left arm and a piece of shrapnel embedded into the right side of his forehead. Initially introduced as recurring "Metal Gear" prequel protagonist and series antagonist Big Boss, hints of his true identity gradually emerge throughout the course of the story until it is ultimately revealed that he is actually a former combat medic who underwent facial reconstruction and subliminal brainwashing to serve as Big Boss\'s body double. The character is voiced by Akio Ōtsuka in the Japanese version and by Kiefer Sutherland in the English version.', 'title': 'Venom Snake'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Levantine cuisine is the traditional cuisine of the Levant, known in Arabic as the Bilad ash-Sham and Mashriq, which covers a large area of the Eastern Mediterranean. It continues to carry an influentially mainstream character in a majority of the dishes today. It is found in the modern states of Jordan, Lebanon, Israel, Palestine, Syria, and parts of southern Turkey near Adana, Gaziantep, and Antakya (the former Vilayet of Aleppo). In the broader family of Mediterranean cuisine, Cypriot cuisine also has strong Levantine influences.', 'title': 'Levantine cuisine'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Despite being relatively restricted to an Atlantic sustenance, Portuguese cuisine has many Mediterranean influences. Portuguese cuisine is famous for seafood. The influence of Portugal\'s former colonial possessions is also notable, especially in the wide variety of spices used. These spices include "piri piri" (small, fiery chili peppers) and black pepper, as well as cinnamon, vanilla and saffron. Olive oil is one of the bases of Portuguese cuisine, which is used both for cooking and flavouring meals. Garlic is widely used, as are herbs, such as bay leaf and parsley.', 'title': 'Portuguese cuisine'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Argentine cuisine is described as a cultural blending of Mediterranean influences (such as those created by Italian and Spanish populations) with and very small inflows (mainly in border areas), Indigenous, within the wide scope of agricultural products that are abundant in the country. Argentine annual consumption of beef has averaged 100\xa0kg (220\xa0lbs) per capita, approaching 180\xa0kg (396\xa0lbs) per capita during the 19th century; consumption averaged 67.7\xa0kg (149\xa0lbs) in 2007. Beyond "asado" (the Argentine barbecue), no other dish more genuinely matches the national identity. Nevertheless, the country\'s vast area, and its cultural diversity, have led to a local cuisine of various dishes. The great immigratory waves consequently imprinted a large influence in the Argentine cuisine, after all Argentina was the second country in the world with the most immigrants with 6.6 million, only second to the United States with 27 million, and ahead of other immigratory receptor countries such as Canada, Brazil, Australia, etc.', 'title': 'Argentine cuisine'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'This is a list of Portuguese dishes and foods. Despite being relatively restricted to an Atlantic sustenance, Portuguese cuisine has many Mediterranean influences. Portuguese cuisine is famous for seafood. The influence of Portugal\'s former colonial possessions is also notable, especially in the wide variety of spices used. These spices include "piri piri" (small, fiery chili peppers) and black pepper, as well as cinnamon, vanilla and saffron. Olive oil is one of the bases of Portuguese cuisine, which is used both for cooking and flavouring meals. Garlic is widely used, as are herbs, such as bay leaf and parsley. Portuguese beverages are also included in this list.', 'title': 'List of Portuguese dishes'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Croatian cuisine is heterogeneous and is known as a cuisine of the regions, since every region of Croatia has its own distinct culinary tradition. Its roots date back to ancient times. The differences in the selection of foodstuffs and forms of cooking are most notable between those in mainland and those in coastal regions. Mainland cuisine is more characterized by the earlier Slavic and the more recent contacts with neighboring cultures—Hungarian and Turkish, using lard for cooking, and spices such as black pepper, paprika, and garlic. The coastal region bears the influences of the Greek and Roman cuisine, as well as of the later Mediterranean cuisine, in particular Italian (especially Venetian). Coastal cuisines use olive oil, and herbs and spices such as rosemary, sage, bay leaf, oregano, marjoram, cinnamon, clove, nutmeg, and lemon and orange rind. Peasant cooking traditions are based on imaginative variations of several basic ingredients (cereals, dairy products, meat, fish, vegetables, nuts) and cooking procedures (stewing, grilling, roasting, baking), while bourgeois cuisine involves more complicated procedures and use of selected herbs and spices. Charcuterie is part of Croatian tradition in all regions. Food and recipes from other former Yugoslav countries are also popular in Croatia.', 'title': 'Croatian cuisine'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Peruvian cuisine reflects local practices and ingredients—including influences from the indigenous population including the Inca and cuisines brought in with immigrants from Europe (Spanish cuisine, Italian cuisine, German cuisine), Asia (Chinese cuisine and Japanese cuisine) and West Africa. Without the familiar ingredients from their home countries, immigrants modified their traditional cuisines by using ingredients available in Peru. The four traditional staples of Peruvian cuisine are corn, potatoes and other tubers, Amaranthaceaes (quinoa, kañiwa and kiwicha) and legumes (beans and lupins). Staples brought by the Spanish include rice, wheat and meats (beef, pork and chicken). Many traditional foods—such as quinoa, kiwicha, chili peppers, and several roots and tubers have increased in popularity in recent decades, reflecting a revival of interest in native Peruvian foods and culinary techniques. Chef Gaston Acurio has become well known for raising awareness of local ingredients.', 'title': 'Peruvian cuisine'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Floribbean cuisine is found in varying forms in Florida restaurants and in the homes of many Floridians throughout the state. The essence of what makes a particular dish "Floribbean" is similar to that of certain other aspects of variable Floridian culture: it is influenced by visitors and immigrants from all over the world, but especially from the Caribbean (with notable influence from Haiti, the Bahamas, Barbados, Jamaica, Trinidad and Tobago), Cuba and Puerto Rico. In the case of southern Florida in particular, a subdivision called Latin-Floribbean or Hispano-Floribbean cuisine also borrows features of Latin American cuisine from such countries as Mexico, Cuba, Puerto Rico, Colombia, Argentina, Brazil, and the Dominican Republic, adding more influences to the mix (along with the USA Common Wealth of Puerto Rico. To distinguish the Latin Caribbean style from the non-Latin Caribbean style, the terms Afro-Floribbean cuisine and Indo-Floribbean cuisine are sometimes used, as the majority of the Caribbean islands have substantial populations of African or Indian heritage, descendants of slaves or immigrants transported to the islands colonized by British, French, and Dutch settlers.', 'title': 'Floribbean cuisine'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'In the past, Phuket was one of Thailand’s commercial ports which traded with other countries. These cultural influences are reflected in the cuisine and local foods. Phuket cuisine and local food (Baba Peranakan food) is the combination of many cultural food habits, whether they be Chinese, Malay or Thai. Some Phuket local food tastes sweet, such as Chinese Hakka cuisine, but it can also be spicy, such as in Thai cuisine and Malay cuisine.', 'title': 'Phuket cuisine'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Argentina is provided with a vast territory and a huge variety of climates and microclimates ranging from tundra and polar in the south to the tropical climate in the north, through a vast expanse of temperate climate and natural wonders like the Aconcagua, the highest mountain in the world outside the Himalayas, the widest river and estuary of the planet (the River Plate), the huge and very mighty Iguazú Falls, some of the flattest and wide meadows-plains of planet Earth (as the Humid Pampas, a large ocean-sea coast in the Argentine Sea), culture, customs and gastronomies famous internationally, a higher degree of development (very high compared to other Latin American countries), good quality of life and people, and relatively well prepared infrastructure make this country one of the most visited of America.', 'title': 'Tourism in Argentina'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Nicaraguan cuisine includes a mixture of indigenous cuisine, Spanish cuisine and Creole cuisine. Despite the blending and incorporation of pre-Columbian and Spanish-influenced cuisine, traditional cuisine differs on the Pacific coast from the Caribbean coast. While the Pacific coast's main staple revolves around local fruits and corn, the Caribbean coast's cuisine makes use of seafood and coconut.", 'title': 'Nicaraguan cuisine'}]

