 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Army United Football Club (Thai: สโมสรฟุตบอลอาร์มี่ ยูไนเต็ด ) is a Thai football club based in the Din Daeng District of Bangkok. They play in the second division in Thai football, the Thai League 2. Their home stadium is known locally as the Thai Army Sports Stadium and more widely known around Asian circles as the Royal Thai Army Stadium of which has been host to numerous international youth matches due to its central Bangkok location. The club play in red shirts with red shorts and red socks.', 'title': 'Army United F.C.'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Congress Street Grounds is a former baseball ground located in Boston, Massachusetts. The ballpark, as the name implies, was along Congress Street, near the intersection of Thompson Place, and not far from the Fort Point Channel on South Boston Flats, a newly filled in piece of land on Boston Harbor. The ground was home to the Boston Reds, that played in the Players' League in 1890 and the American Association in 1891.", 'title': 'Congress Street Grounds'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Braves Field was a baseball park in the Northeastern United States, located in Boston, Massachusetts. Today the site is home to Nickerson Field on the campus of Boston University. The stadium was home of the Boston Braves of the National League from 1915–1952, prior to the Braves' move to Milwaukee in 1953. The stadium hosted the 1936 Major League Baseball All-Star Game and Braves home games during the 1948 World Series. The Boston Red Sox used Braves Field for their home games in the 1915 and 1916 World Series since the stadium had a larger seating capacity than Fenway Park. Braves Field was the site of Babe Ruth's final season, playing for the Braves in 1935. From 1929 to 1932, the Boston Red Sox played select regular season games periodically at Braves Field. On May 1, 1926, Braves Field hosted the longest baseball game in history – 26 Innings. The game ended in a 1–1 tie.", 'title': 'Braves Field'}
