 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The New Bedford Bay Sox are a baseball team that plays in the New England Collegiate Baseball League, a collegiate summer baseball league located in the northeastern United States region of New England. The team is located in New Bedford, Massachusetts. New Bedford's Paul Walsh Field serves as the home field of the Bay Sox. Th NECBL's players use wooden bats, as opposed to aluminum, and are college baseball players recruited from the top intercollegiate baseball programs in the United States. The franchise has appeared in league finals four times in their history, all as the Torrington Twisters (1997, 1998, 2003, 2006), and have twice played host to the NECBL All-Star Game as the Twisters (1998, 2008). Pat and Beth O'Connor, owners of Little Fenway and Little Wrigley joined the ownership team of the New Bedford Bay Sox in October, 2011, and signed a 3-year lease to play at Paul Walsh Field. In November 2011, former MLB player Rick Miller was announced as the 2012 Bay Sox manager. Miller was succeeded as manager prior to the 2015 season by Westport, MA native and former Boston Red Sox draft pick Kyle Fernandes. Fernandes has led the Bay Sox to back-to-back postseason appearances in his two seasons as manager, most recently losing in a three-game series to the eventual NECBL Champions the Mystic Schooners.", 'title': 'New Bedford Bay Sox'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Newark Bay is a tidal bay at the confluence of the Passaic and Hackensack Rivers in northeastern New Jersey. It is home to the Port Newark-Elizabeth Marine Terminal, the largest container shipping facility in Port of New York and New Jersey, the third largest and one of the busiest in the United States. An estuary, it is periodically dredged to accommodate ocean-going ships.', 'title': 'Newark Bay'}]

