 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Scott Christopher Williams (born March 21, 1968) is a retired American professional basketball player in the National Basketball Association. Standing at 6\' 10", he was capable of playing as a power forward or a center. Williams contributed off the bench during the Chicago Bulls\' first three-peat championships (1991-93) early in his professional career. He developed into a front court reserve journeyman during his ten-plus seasons in the NBA, where he was known for his hustle and strong defense. Since his retirement, Williams has coached in the NBA Development League and NBA as well as commentating for a variety of NBA teams. Williams is currently the color analyst for the Grand Canyon Antelopes men\'s basketball team. Scott has a daughter, (Ava Williams) and a son (Ben Williams).', 'title': 'Scott Williams (basketball)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Maurice Williams (born December 19, 1982) is an American professional basketball player who last played for the Cleveland Cavaliers of the National Basketball Association (NBA). After a successful high school career at Murrah High School, Williams attended college at the University of Alabama, where he led his team as a freshman to a 27–8 record, and also shared an SEC regular-season championship. After two seasons at Alabama, Williams entered the 2003 NBA draft where he was selected with the 47th overall pick by the Utah Jazz. Throughout his career, he has also played for the Milwaukee Bucks, Los Angeles Clippers, Portland Trail Blazers, Minnesota Timberwolves, Charlotte Hornets and Cleveland Cavaliers. In 2009, Williams was selected as an NBA All-Star. In 2016, he won an NBA championship with the Cavaliers.', 'title': 'Mo Williams'}
