 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Freeman Williams (born May 15, 1956) is a retired American professional basketball player. He was the 1978 NCAA men's basketball Division I scoring champion, and the Portland State University all-time scoring leader. Williams was the NCAA Division I national men's basketball individual scoring leader in 1977 and 1978. Williams was a consensus second team All-American in 1978. He is second in Division I history in scoring, trailing only Pete Maravich. He was born in Los Angeles.", 'title': 'Freeman Williams'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Darren Crocker (born 26 March 1967) is a former Australian rules footballer and former player of the North Melbourne Football Club in the Australian Football League (AFL). On 16 June 2009, he was appointed caretaker coach of the North Melbourne Football Club after the resignation of Dean Laidley. On 17 August 2009 the North Melbourne Football Club appointed Brad Scott as their senior coach, thus Crocker was not retained as North Melbourne coach for the 2010 season. However, he remained as assistant coach at North Melbourne Football Club. In 2015, Crocker again served as acting coach when Scott underwent back surgery, and again for one match in 2016 when Scott was ill.', 'title': 'Darren Crocker'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Cameron Pedersen (born 17 March 1987) is a professional Australian rules footballer playing for the Melbourne Football Club in the Australian Football League (AFL). A utility, 1.93 m tall and weighing 99 kg , Pedersen has played the majority of his career in the forward line. After missing out on being drafted at eighteen years of age, he played five seasons in the Victorian Football League (VFL) for the Box Hill Hawks . His form during the 2010 season led to him being recruited by the North Melbourne Football Club with the seventeenth selection in the 2011 rookie draft and he made his debut in the 2011 season. After two seasons with North Melbourne, playing in sixteen matches and winning the club's best first year player, he was traded to the Melbourne Football Club during the 2013 trade period.", 'title': 'Cameron Pedersen'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Aaron Black (born 29 November 1990) is a professional Australian rules footballer playing for the Geelong Football Club in the Australian Football League (AFL). He previously played for North Melbourne Football Club from 2011 to 2016. He was recruited by North Melbourne with the twenty-fifth selection in the 2009 national draft and he made his senior debut in round 24 of the 2011 season against Richmond . In 2016, he spent the entire season in the Victorian Football League (VFL) and at the end of the season, he mutually agreed with North Melbourne to seek opportunities at another club despite being contracted to North Melbourne until the end of 2017. He was officially traded to Geelong in October.', 'title': 'Aaron Black (footballer, born 1990)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Corey Wagner (born 23 March 1997) is an Australian rules footballer playing for the North Melbourne Football Club in the Australian Football League (AFL). He is the younger brother of Melbourne defender, Josh Wagner. He was drafted by the North Melbourne Football Club with their fourth selection and forty-first overall in the 2015 national draft. He made his debut in the nine point loss against Hawthorn in round 13, 2016 at Etihad Stadium.', 'title': 'Corey Wagner'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Ryan Clarke (born 17 June 1997) is an Australian rules footballer playing for the North Melbourne Football Club in the Australian Football League (AFL). He was drafted by the North Melbourne Football Club with their second selection and thirty-first overall in the 2015 national draft. Prior to being drafted he attended the prestigious Melbourne Grammar School and was captain of their First XVIII football team. He made his debut in the thirty-two point loss against West Coast in round 16, 2016 at Domain Stadium. He was rewarded with the round nomination for the Rising Star in the round 18, forty-point win against the Collingwood Football Club at Etihad Stadium where he recorded twenty-seven disposals, twelve contested possessions, four inside-50s and three goal assists.', 'title': 'Ryan Clarke (Australian footballer)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Ian James Brayshaw (born 14 January 1942) is a former Australian sportsman. He played both Australian rules football and cricket. Both his sons, Mark Brayshaw and James Brayshaw were noted athletes in their respective sports; Mark playing football and James playing cricket. Other son Rob is an all round cricketer who bowls a heavy ball and starred in Bridgetowns Cricket Clubs Premiership in 2016/17. Mark's son, Angus Brayshaw is forging a career at Melbourne Football Club.", 'title': 'Ian Brayshaw'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Mark Andrew Brayshaw (born 5 February 1966) is a former Australian rules footballer who played for North Melbourne Football Club in the AFL. He is the brother of James Brayshaw and the son of Ian Brayshaw. Angus Brayshaw is Mark's son. Thus continuing into a third generation of footballers in the Brayshaw family.", 'title': 'Mark Brayshaw'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Norman Selwyn 'Sel' Murray (23 November 1917 – 29 May 1992) was an Australian rules footballer. Mainly used as a full forward, he played with the North Melbourne Football Club in the Victorian Football League (VFL) from 1937 to 1944 and then for the Richmond Football Club in 1945 and 1946. He played the 1947 season for North Melbourne seconds, leading the competition goalkicking with 123 for the season and playing in the seconds' premiership side. He ended his career back in the North Melbourne senior side for much of the 1948 season. His 88 goals in 1941 was the most in the League and he took just 73 games to reach 300 career goals which is equal third fastest of all time.", 'title': 'Sel Murray'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 1996 AFL Grand Final was an Australian rules football game contested between the North Melbourne Football Club and the Sydney Swans, held at the Melbourne Cricket Ground in Melbourne on 28 September 1996. It was the 100th annual Grand Final of the Australian Football League (formerly the Victorian Football League), staged to determine the premiers for the 1996 AFL season. The match, attended by 93,102 people, was won by North Melbourne by a margin of 43 points, marking that club's third premiership victory. North Melbourne were awarded a gold premiership cup instead of the usual silver in honor of the centenary grand final.", 'title': '1996 AFL Grand Final'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The 1975 VFL Grand Final was an Australian rules football game contested between the North Melbourne Football Club and the Hawthorn Football Club, held at the Melbourne Cricket Ground in Melbourne on 27 September 1975. It was the 79th annual Grand Final of the Victorian Football League, staged to determine the premiers for the 1975 VFL season. The match, attended 110,551 spectators, was won by North Melbourne by a margin of 55 points, marking that club's first premiership victory. In so doing, it became the last of the 12 VFL teams to win a flag.", 'title': '1975 VFL Grand Final'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Luis Alfredo Garavito Cubillos, also known as "La Bestia" ("The Beast") or "Tribilín" (named after Disney character "Goofy"\'s Latin American Spanish name) is a Colombian rapist and serial killer. In 1999, he admitted to the rape, torture and murder of 147 young boys. His victims, based on the locations of skeletons listed on maps that Garavito drew in prison, could eventually exceed 300; Garavito continues to confess to more murders. He has been described by local media as "the world\'s worst serial killer". According to the Attorney General\'s Office and various judicial bodies, Luis Alfredo Garavito is the "second serial killer of the world." Likewise, the judicial body ruled that all Garavito\'s sentences total 1853 years and nine days in jail.', 'title': 'Luis Garavito'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Death of a Soldier is a 1986 Australian film based on the life of American serial killer Eddie Leonski. The film was shot using locations around Melbourne, Victoria.', 'title': 'Death of a Soldier'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Henry: Portrait of a Serial Killer is a 1986 American psychological horror crime film directed and co-written by John McNaughton about the random crime spree of a serial killer who seemingly operates with impunity. It stars Michael Rooker as the nomadic killer Henry, Tom Towles as Otis, a prison buddy with whom Henry is living, and Tracy Arnold as Becky, Otis's sister. The characters of Henry and Otis are loosely based on real life serial killers Henry Lee Lucas and Ottis Toole.", 'title': 'Henry: Portrait of a Serial Killer'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Edward Joseph Leonski (December 12, 1917 – November 9, 1942) was an American soldier and serial killer responsible for the strangling murders of three women in Melbourne, Australia. Leonski was known as the "Brownout Strangler", given Melbourne\'s wartime status of keeping low lighting (not as stringent as a wartime blackout). His self-confessed motive for the killings was a twisted fascination with female voices, especially when they were singing, and his claim that he killed the women to "get at their voices."', 'title': 'Eddie Leonski'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Dexter", or "Pilot", is the pilot episode of the first season television drama series "Dexter", which premiered on October 1, 2006 on Showtime in the United States. The episode was written by developer James Manos, Jr. and directed by Michael Cuesta. It was based on the opening of the novel "Darkly Dreaming Dexter" by Jeff Lindsay. The pilot introduces the series\' protagonist, Dexter Morgan (Michael C. Hall), a Miami Metro Police Department blood spatter analyst with a double life as a serial killer. While solving murders in the Homicide division, Dexter also spends his time hunting and killing murderers and criminals who have escaped the justice system. The pilot introduces the "Ice Truck Killer", a serial killer who targets prostitutes and leaves their bodies dismembered and bloodless, and the rivalry that develops between the killer and Dexter.', 'title': 'Dexter (episode)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Charles Edmund Cullen (born February 22, 1960) is a former nurse who is the most prolific serial killer in New Jersey history and is suspected to be the most prolific serial killer in American history. He confessed to authorities that he killed up to 40 patients during the course of his 16-year nursing career. But in subsequent interviews with police, psychiatric professionals, and journalists Charles Graeber and Steve Kroft, it became clear that he had killed many more, whom he could not specifically remember by name, though he could often remember details of their case. Experts have estimated that Charles Cullen may ultimately be responsible for 400 deaths, which would make him the most prolific serial killer in American history.', 'title': 'Charles Cullen'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'My Brother the Serial Killer is a 2012 American television documentary about serial killer Glen Rogers, otherwise known as the "Casanova Killer", who was convicted for a series of murders and arsons. The documentary was narrated by Rogers\' brother Clay Rogers and aired on Investigation Discovery in November 2012. "My Brother the Serial Killer" received widespread media attention for Clay\'s claims that his brother was responsible for the 1994 murders of Nicole Brown Simpson and Ronald Lyle Goldman.', 'title': 'My Brother the Serial Killer'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Sun Hill Serial Killer was a major storyline from ITV\'s cop show "The Bill". Known originally as the "River Murders", the storyline spanned several months in 2002 and served as the exit for popular cast regular Cass Rickman (played by Suzanne Maddock). It was the first of several serial killer storylines from the show. Events came to a head in the New Year of 2003, when Acting DI Samantha Nixon discovers the truth and is taken hostage by the serial killer, before a final confrontation in which she is overpowered by DC Duncan Lennox, charged and thrown into the cells at Sun Hill Station.', 'title': 'Sun Hill Serial Killer'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Cold North Killers: Canadian Serial Murder is a 2012 Canadian non-fiction book written by Lee Mellor and published by Dundurn Press. It documents the lives of sixty Canadian serial killers, with the earliest being Edward H. Rulloff and the most recent being Russell Williams. The book uses Katherine Ramsland\'s interpretation of what constitutes a serial killer—someone who has killed at least two people on two separate occasions, and who attempted to or likely would have killed again—as outlined in her 2007 book "The Human Predator". "Cold North Killer\'s" own definition of what constitutes a Canadian serial killer includes both Canadians who committed murder abroad (such as Keith Hunter Jesperson and Gordon Stewart Northcott) and non-Canadians who committed murder in Canada (like William Dean Christenson and Earle Nelson).', 'title': 'Cold North Killers: Canadian Serial Murder'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Harvey Miguel Robinson (born December 6, 1974) is an American serial killer who is a prisoner on death row in Pennsylvania. He is one of the youngest serial killers in American history. He was 18 years old when he was apprehended for his crimes. He is also the first serial killer in the history of Allentown, Pennsylvania.', 'title': 'Harvey Miguel Robinson'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'A Prairie Home Album is an album from the Prairie Home Companion radio show. It features items written for the early days of the program, when it was a morning show broadcast from KSJN in St. Paul, MN.', 'title': 'A Prairie Home Album'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Thomas Alan Keith (December 21, 1946 – October 30, 2011) was a radio personality who worked for Minnesota Public Radio in St. Paul, Minnesota. He was the engineer for Garrison Keillor when the latter began his early morning radio show from the St. John\'s University, Collegeville, Minnesota studio. Keillor wanted dialogue during the program and Keith was about the only other person around at that early hour. Keith was one of the primary sound effects performers for the radio show "A Prairie Home Companion" and was often an actor in sketches written by Keillor. Keillor created the persona of Jim Ed Poole for Keith on the old early morning show. Jim Ed was said to have grown up in West St. Paul, Minnesota and graduated from Henry Sibley High School.', 'title': 'Tom Keith'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Lake Wobegon Trails are two paved recreational rail trails in central Minnesota, named after the fictional Lake Wobegon in Garrison Keillor\'s "Prairie Home Companion". Each trail is marked with mileposts every 0.5 mi , corresponding with the mile markers of the former railroad lines. Snowmobile use is allowed on the trail in winter, conditions permitting.', 'title': 'Lake Wobegon Trails'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Bill Caswell is a country music singer-songwriter and musician active since the early 1980s. Together with his wife Rosi Caswell, the duo from Bartlesville, Oklahoma perform on rare old style instruments including the ukelin, mandolin-guitar, bell-harp, and tremeloa. In the 1980s he performed his music on television in "Hee Haw" and on live radio in "A Prairie Home Companion". The two together performed at Dollywood in Gatlinburg, Tennessee for five seasons.', 'title': 'Bill Caswell'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Fitzgerald Theater is the oldest active theatre in Saint Paul, Minnesota, and the home of American Public Media\'s "A Prairie Home Companion". It was one of many theaters built by the Shubert Theatre Corporation, and was initially named the Sam S. Shubert Theater. It was designed by the noted Chicago architectural firm of Marshall and Fox, architects of several theaters for the Shuberts. In 1933, it became a movie outlet known as the World Theater. The space was purchased by Minnesota Public Radio in 1980, restored with a stage in 1986 as a site for "Prairie Home", and renamed in 1994 after St. Paul native F. Scott Fitzgerald.', 'title': 'Fitzgerald Theater'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Gary Edward "Garrison" Keillor (born August 7, 1942) is an American author, storyteller, humorist, voice actor, and radio personality. He is best known as the creator of the Minnesota Public Radio show "A Prairie Home Companion" (called "Garrison Keillor\'s Radio Show" in some international syndication), which he hosted from 1974 to 2016. Keillor created the fictional Minnesota town Lake Wobegon, the setting of many of his books, including "Lake Wobegon Days "and "". Other creations include Guy Noir, a detective voiced by Keillor who appeared in "A Prairie Home Companion" comic skits.', 'title': 'Garrison Keillor'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Lake Wobegon is a fictional town created by Garrison Keillor to provide the setting for the long-running radio broadcast, "Prairie Home Companion". Lake Wobegon is also the setting for many of Keillor\'s stories and novels. It is described as a small rural town in central Minnesota, and it is peopled with fictional characters and places, many that have become familiar to listeners of the broadcast. The events and adventures of the imaginary townspeople provide the prolific Keillor with a wealth of stories, that are humorous and at times touching and thoughtful.', 'title': 'Lake Wobegon'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Lake Wobegon Days is a novel by Garrison Keillor, first published in hardcover by Viking in 1985. Based on material from his radio show "A Prairie Home Companion", the book brought Keillor\'s work to a much wider audience and achieved international success. Like some of Keillor\'s other books, it is unusual in that it could be said that the audiobook preceded the publication in written form.', 'title': 'Lake Wobegon Days'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'A Prairie Home Companion is a live weekly radio variety show hosted by musician and songwriter Chris Thile. The program was created in 1974 by Garrison Keillor, who hosted it until 2016. It airs on Saturdays from 5 to 7 p.m. Central Time, from the Fitzgerald Theater in Saint Paul, Minnesota; it is also frequently heard on tours to New York City and other US cities. The show is known for its musical guests, especially folk and traditional musicians, tongue-in-cheek radio drama, and relaxed humor. Keillor\'s wry storytelling segment, "News from Lake Wobegon", was the show\'s best-known feature during his long tenure.', 'title': 'A Prairie Home Companion'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The live weekly radio variety show, A Prairie Home Companion with Chris Thile, whose title indicates the new program host, musician Chris Thile, derives from the historic "A Prairie Home Companion with Garrison Keillor" ("APHC") radio show, where the changeover in the onstage hosting and program began on October 15, 2016. Thile, an American virtuoso mandolinist and singer-songwriter, had a two decade history with "APHC" and is known for his work in the folk and progressive bluegrass groups Nickel Creek and Punch Brothers. After two unprecedented guest host spots in 2015, Keillor decided on his successor, featured Thile as host again in January–February 2016, and fully ceded his hosting role to Thile in the October 2016 performance at the Fitzgerald Theater in St. Paul, Minnesota, continuing as the show\'s Executive Producer. As of 1 November 2016, the new program presents expanded musical and comedic elements, retaining the template of the earlier program (e.g., its most recent acting and sound effect cast, and "sponsorships" from faux companies), but without such features as its earlier signature "Lives of the Cowboys" series and "News from Lake Wobegon" monologue. Early reviews of the new program have been uniformly positive, focusing on the remaining familiar elements and on the new music and expanded musical focus brought by the new host.', 'title': 'A Prairie Home Companion with Chris Thile'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Lone Ranger (Original Motion Picture Score) is the film score for the Walt Disney Pictures film, "The Lone Ranger" by Hans Zimmer, released on CD and digital download on July 2, 2013 by Walt Disney Records. The physical release was in association with Intrada Records.', 'title': 'The Lone Ranger (soundtrack)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Jungle Book (formerly known as Jungle Book: Origins) is an upcoming live-action adventure fantasy film directed by Andy Serkis and written by Callie Kloves, based on "The Jungle Book" by Rudyard Kipling. The film stars Rohan Chand, Matthew Rhys and Freida Pinto, with motion capture performances from Tom Hollander, Christian Bale, and Benedict Cumberbatch.', 'title': 'Jungle Book (2018 film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'John Reynolds Hughes (February 11, 1855 – June 3, 1947) was a Texas Ranger and cowboy of the Old West, and later an author. Several books were written about his long history as one of the most influential Texas Rangers of all time. It has been suggested he was the inspiration for the Lone Ranger character, since Zane Grey dedicated his most famous book "The Lone Star Ranger" to Hughes in 1915. The ambush of Texas Ranger Captain Frank Jones and Hughes\' long hunt for the killers also support this theory. Hughes also told relatives that he believed he was the inspiration for the Lone Ranger character.', 'title': 'John Hughes (lawman)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Lone Ranger and the Lost City of Gold is a 1958 American Western film in Eastmancolor released by United Artists in June 1958. The second of two theatrical features specifically based on and continuing the TV show "The Lone Ranger" it stars Clayton Moore and Jay Silverheels, reprising their roles from the TV series. The first feature film was 1956\'s "The Lone Ranger". No further films based on this specific version of the characters were made after this one.', 'title': 'The Lone Ranger and the Lost City of Gold'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Lone Ranger is a 1956 Western film based on "The Lone Ranger" television series, starring Clayton Moore and Jay Silverheels. "The Lone Ranger" was the first of two theatrical features based on the popular TV series of the same name; the other one being "The Lone Ranger and the Lost City of Gold" (1958), which was Bonita Granville\'s last film appearance. She retired from the screen to marry Jack Wrather.', 'title': 'The Lone Ranger (1956 film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Lone Ranger was a 2003 TV-movie and an attempt by The WB to revive the "Lone Ranger" franchise in a new generation. The film starred Chad Michael Murray as the Lone Ranger and Nathaniel Arcand as Tonto.', 'title': 'The Lone Ranger (2003 film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Second Jungle Book is a sequel to "The Jungle Book" by Rudyard Kipling. First published in 1895, it features five stories about Mowgli and three unrelated stories, all but one set in India, most of which Kipling wrote while living in Vermont. All of the stories were previously published in magazines in 1894-5, often under different titles. The original book is now worth $3.4 million. The 1994 film "The Jungle Book" used this book as a source.', 'title': 'The Second Jungle Book'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Jungle Book is a 1942 independent American Technicolor action-adventure film by the Hungarian Korda brothers, based on a screenplay adaptation by Laurence Stallings of Rudyard Kipling\'s "The Jungle Book", about a wild boy who is kidnapped by villagers who are cruel to animals as they attempt to steal the jungle\'s lost treasure that possesses people.', 'title': 'Jungle Book (1942 film)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "The Jungle Book is a 1967 American animated musical adventure film produced by Walt Disney Productions. Inspired by Rudyard Kipling's book of the same name, it is the 19th Disney animated feature film. Directed by Wolfgang Reitherman, it was the last film to be produced by Walt Disney, who died during its production. The plot follows Mowgli, a feral child raised in the Indian jungle by wolves, as his friends Bagheera the panther and Baloo the bear try to convince him to leave the jungle before the evil tiger Shere Khan arrives.", 'title': 'The Jungle Book (1967 film)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "The Lone Ranger is a 2013 American western action film directed by Gore Verbinski from a screenplay written by Justin Haythe, Ted Elliott and Terry Rossio. Based on the radio series of the same name, the film stars Johnny Depp as Tonto, the narrator of the events, and Armie Hammer as John Reid, the Lone Ranger. It relates Tonto's memories of the duo's earliest efforts to subdue local villainy and bring justice to the American Old West. William Fichtner, Barry Pepper, Ruth Wilson, James Badge Dale, Tom Wilkinson and Helena Bonham Carter also are featured in supporting roles. It is the first theatrical film featuring the Lone Ranger and Tonto characters in more than 32 years.", 'title': 'The Lone Ranger (2013 film)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Sophie Elizabeth Wilcox (born 2 January 1975 in Croydon, London) is an English actress who is most notable for appearing in the BBC miniseries adaptation of "The Chronicles of Narnia" as Lucy Pevensie when she was 13 years old. She appeared in "The Lion, the Witch and the Wardrobe" in 1988, as well as its sequel "Prince Caspian and the Voyage of the Dawn Treader" in 1989.', 'title': 'Sophie Wilcox'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Tumnus is a fictional character in C. S. Lewis\' series "The Chronicles of Narnia". He is featured prominently in "The Lion, the Witch and the Wardrobe" and also appears in "The Horse and His Boy" and "The Last Battle". He is close friends with Lucy Pevensie and is the first creature she meets in Narnia, as well as the first Narnian to be introduced in the series. Lewis said that the first Narnia story, "The Lion, the Witch and the Wardrobe", all came to him from a single picture he had in his head of a faun carrying an umbrella and parcels through a snowy wood. In that way, Tumnus was the initial inspiration for the entire Narnia series.', 'title': 'Mr. Tumnus'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Lucy Barfield (2 November 1935 – 3 May 2003) was the godchild of C.S. Lewis. "The Lion the Witch and the Wardrobe" is dedicated to Lucy, who also lent her name to the book\'s heroine, Lucy Pevensie.', 'title': 'Lucy Barfield'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'From Unknown Worlds is an anthology of fantasy fiction short stories edited by John W. Campbell, Jr. and illustrated by Edd Cartier, the first of a number of anthologies drawing their contents from the classic magazine "Unknown" of the 1930s-40s. It was first published in magazine format by American company Street & Smith in 1948; the publication was an attempt to determine if there was a market for a revived "Unknown". Street & Smith printed 300,000 copies, against the advice of John Campbell, but although it sold better than the original, too many copies were returned for the publisher to be willing to revive the magazine. The first British edition was issued by Atlas Publishing in 1952; part of the run was issued in a hardcover binding. This edition omitted the story "One Man\'s Harp." .', 'title': 'From Unknown Worlds'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Lantern Waste is a fictional place in "The Chronicles of Narnia" series by C. S. Lewis. It is a wood and is notable as the place where Lucy Pevensie and Mr. Tumnus meet, which is the first scene of Narnia described in the books. The lamppost in the wood is an iconic image of Narnia, and the question of its origin is what convinced Lewis to write more than one book on Narnia. One of King Edmund\'s titles is "Duke of Lantern Waste".', 'title': 'Lantern Waste'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The Chronicles of Narnia is a series of seven fantasy novels by C. S. Lewis. It is considered a classic of children\'s literature and is the author\'s best-known work, having sold over 100 million copies in 47 languages. Written by Lewis, illustrated by Pauline Baynes, and originally published in London between 1950 and 1956, "The Chronicles of Narnia" has been adapted several times, complete or in part, for radio, television, the stage, and film.', 'title': 'The Chronicles of Narnia'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Lucy Pevensie is a fictional character in C. S. Lewis\'s "The Chronicles of Narnia" series. She is the youngest of the four Pevensie children, and the first to find the Wardrobe entrance to Narnia in "The Lion, the Witch and the Wardrobe". Of all the Pevensie children, Lucy is the closest to Aslan. Also, of all the humans who have visited Narnia, Lucy is perhaps the one that believes in Narnia the most. She is ultimately crowned Queen Lucy the Valiant, co-ruler of Narnia along with her two brothers and her sister. Lucy is the central character of the four siblings in the novels. Lucy is a principal character in three of the seven books ("The Lion, the Witch and the Wardrobe", "Prince Caspian", and "The Voyage of the Dawn Treader"), and a minor character in two others ("The Horse and His Boy" and "The Last Battle").', 'title': 'Lucy Pevensie'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Eustace Clarence Scrubb is a fictional character in C. S. Lewis\'s Chronicles of Narnia. He appears in "The Voyage of the Dawn Treader", "The Silver Chair", and "The Last Battle". In "The Voyage of the Dawn Treader", he is accompanied by Edmund and Lucy Pevensie, his cousins. In "The Silver Chair" and "The Last Battle", he is accompanied by Jill Pole, a classmate from his school.', 'title': 'Eustace Scrubb'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The cosmological interpretation of quantum mechanics, proposed by Anthony Aguirre and Max Tegmark, is an interpretation of quantum mechanics that applies in the context of eternal cosmological inflation, which arguably predicts an infinite three-dimensional space with infinitely many planets and infinitely many copies of any quantum system. According to this interpretation, the wavefunction for a quantum system describes not some imaginary ensemble of possibilities for what the system might be doing, but rather the actual spatial collection of identical copies of the system that exist in our infinite space. Its collapse can be avoided. Moreover, the quantum uncertainty that you experience simply reflects your inability to self-locate in space, i.e., to know which of your infinitely many copies throughout space is the one having your subjective perceptions.', 'title': 'Cosmological interpretation of quantum mechanics'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Georgina Helen "Georgie" Henley (born 9 July 1995) is an English actress. She is best known for her portrayal of Lucy Pevensie in "The Chronicles of Narnia" film series.', 'title': 'Georgie Henley'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Palandöken Ice Skating Hall (Turkish: "Palandöken Buz Pateni Salonu" ), formerly GSIM Yenişehir Ice Hockey Hall (Turkish: "GSİM Yenişehir Buz Hokey Salonu" ) or Erzurum Ice Skating Hall (Turkish: "Erzurum Buz Pateni Salonu" ), is an indoor ice skating and ice hockey rink located at Ahmet Baba neighborhood of Palandöken district in Erzurum, eastern Turkey. It was opened in 2008.', 'title': 'Palandöken Ice Skating Hall'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Ice skating is popular in the north of India in places like Ladakh, Kashmir and Shimla where cold weather occurs and it is possible to skate outdoors. Much of India has a tropical climate, hence in the rest of the country, ice skating is limited to the few artificial rinks available. Many skating lovers from India head to places like Shimla, Kashmir and Ladakh, and also many expatriates from countries where ice skating is popular in order to experience ice skating at some of the highest rinks in the world. An ice skating festival is organised in Shimla every year.', 'title': 'Ice skating in India'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'An ice rink (or ice skating rink) is a frozen body of water and/or hardened chemicals where people can ice skate or play winter sports. Besides recreational ice skating, some of its uses include ice hockey, bandy, rink bandy, ringette, broomball, speed skating, figure skating, ice stock sport and curling as well as exhibitions, contests and ice shows. There are two types of rinks in prevalent use today: natural, where freezing occurs from cold ambient temperatures, and artificial (or mechanically frozen), where a coolant produces cold temperatures in the surface below the water, causing the water to freeze. There are also synthetic ice rinks where skating surfaces are made out of plastics.', 'title': 'Ice rink'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'John Towill coached and choreographed national and international champions in dance, freestyle, pairs, and synchronized ice skating. He is a member of the National Ice Skating Association, U.S. Figure Skating, PSA, and the Ice Skating Institute. He was a member of the Great Britain International Team and a Great Britain Professional Champion. Towill is currently the head coach of the Precisely Right synchronized skating team from Mennen Arena in Morris Plains, New Jersey, United States.', 'title': 'John Towill'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Iceworld Boondall is an ice sports and public ice skating centre, located approximately 20\xa0km north of Brisbane, Queensland. It hosts a number of major ice hockey games, including Australian Women's Ice Hockey League games. The venue offers a wide variety of activities including ice skating lessons, birthday parties, figure skating, speed skating, curling, synchronised skating, public skating sessions, and it is also the home venue of the Brisbane Goannas. The venue has been operating in Brisbane for over 30 years. Iceworld Boondall is also a host venue for the Duke Trophy, an annual inter-state short track speed skating competition in Australia.", 'title': 'Ice World Boondall'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Canterbury Olympic Ice Rink is an ice sports and public ice skating centre, located in the Sydney suburb of Canterbury, New South Wales. It hosts a number of major ice hockey games, including Australian Women's Ice Hockey League games. The venue offers a wide variety of activities including ice skating lessons, birthday parties, figure skating, speed skating, curling, synchronised skating, public skating sessions, and it is also the home venue of the Sydney Sirens. It is also the home venue of the Sydney Figure Skating Club, Sydney Arrows (speed skating), Canterbury Eagles Ice Hockey Club and is also a host venue of the East Coast Super League, Sydney's elite ice hockey tournament.", 'title': 'Canterbury Olympic Ice Rink'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Ice Skating Institute (formerly the Ice Skating Institute of America) is a trade association for ice rinks, and also an international governing body for recreational figure skating. It was founded in 1959 to proliferate the building of permanent indoor ice rinks, which numbered fewer than 100 at the time, as well as to promote skating as a recreational activity. The ISI has developed a program of tests and competitions in all areas of figure skating, as well as limited areas of speed skating and ice hockey, from "Tot" levels to advanced tests that would provide interesting challenges even to Olympic medalists.', 'title': 'Ice Skating Institute'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Adelaide Glaciarium (also known as Ice Palace Skating Rink) was the first indoor ice skating facility built in Australia. This is the birthplace for ice skating in Australia and is the location of the first hockey on the ice match in the country, which was an adaptation of roller polo for the ice using ice skates. Contemporary ice hockey was never played at this venue but this ice skating rink, the country\'s first, provided the "test bed" facility for its successor the Melbourne Glaciarium, the birthplace of ice hockey in Australia.', 'title': 'Adelaide Glaciarium'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Anjelika Alexeyevna Krylova (Russian: Анжелика Алексеевна Крылова ; born 4 July 1973) is a Russian retired ice dancer. With partner Oleg Ovsyannikov, she is the 1998 Olympic silver medalist and two-time (1998, 1999) World champion. She currently works as a coach and choreographer in Bloomfield Hills, Michigan.', 'title': 'Anjelika Krylova'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Vladimir Anatolyevich Fedorov or Fyodorov (Russian: Владимир Анатольевич Фёдоров , born 22 April 1971) is a Russian former competitive ice dancer. He is the 1993 World bronze medalist with Anjelika Krylova.', 'title': 'Vladimir Fedorov'}]

