[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Henley Hearing was founded in 2008 by Leon Cox however, it is no longer called Henley Hearing Centre and has changed its name to the HEARING CLINIC HENLEY. as the UK's first hearing aid company to specialise in designer digital hearing aids. It was founded amid reports from the hearing charity RNID that some people delayed treatment of their hearing loss on aesthetic grounds. The company operates in Oxfordshire, Buckinghamshire, Hertfordshire and Berkshire. To ensure vulnerable patients did not get confused [Not to be confused with Henley Hearing Care]. The company traded from the Henley Chiropractic Clinic, 1 West Lane, Henley-on-thames since 2014. and moved to 25 hart street, Henley in 2015.", 'title': 'Henley hearing'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Leeds is a city in West Yorkshire, England. Historically in Yorkshire's West Riding, the history of Leeds can be traced to the 5th century, when the name referred to a wooded area of the Kingdom of Elmet. The name has been applied to many administrative entities over the centuries. It changed from being the name of a small manorial borough in the 13th century, through several incarnations, to being the name attached to the present metropolitan borough. In the 17th and 18th centuries Leeds became a major centre for the production and trading of wool.", 'title': 'Leeds'}
