 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Long Lane is the medieval and modern name of the Roman road that ran almost due westwards from Derventio, the Roman fort and "vicus" in the suburbs of modern Derby, through Derbyshire to Rocester (where there was a Roman settlement) and Draycott in the Moors. From that point onwards the same road -- no longer called "The Long Lane" -- continued through Staffordshire to Chesterton near Newcastle-under-Lyme. Its destination was Middlewich (Latin "Salinae"), from which the important city of Chester (Latin "Deva") was in easy reach.', 'title': 'The Long Lane (Derbyshire)'}
