 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Indian Creek is a partly natural and partly man-made waterway in the city of Miami Beach, Florida, United States. It starts as a man-made canal where Biscayne Bay meets Lincoln Road, and runs along Dade Boulevard, forming the boundary between South Beach and the rest of the city. At 24th street the canal opens into the natural waterway and continues north through the city past Allison Island where it opens into Biscayne Bay, till 71st Street where it merges with Normandy and Tatum Waterways and is no longer called Indian Creek.', 'title': 'Indian Creek (Miami Beach)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'John Wilkinson Birch was born 1878 in Garforth, Leeds to George Birch of Parlington and Alice Ellen Smith of Garforth he married Annie Simpson of Kippax in 1898. He died on the 10 October 1953 (aged 75) in Barwick in Elmet, Leeds while living on Chapel Lane. He was an English professional rugby league footballer who played in the 1900s, playing at representative level for Great Britain, and England, and at club level for Leeds Parish Church, and Leeds (Heritage № 130), as a prop , i.e. number 8 or 10, during the era of contested scrums.', 'title': 'John Birch (rugby league)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Barwick-in-Elmet is a village in West Yorkshire, 7 mi east of Leeds city centre. It is one of only three places in the area to be explicitly associated with the ancient Romano-British kingdom of Elmet, the others being Scholes-in-Elmet and Sherburn-in-Elmet. It is part of the civil parish of Barwick in Elmet and Scholes. The name Barwick comes form the Old English for "barley wick", and was recorded in the Domesday Book of 1086 as "Bereuuith".', 'title': 'Barwick-in-Elmet'}
