 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Kumo Xi (: "Kùmò Xī" ; called the Xi since the Sui dynasty (581-618 AD)), also Tatabi, were a Mongolic steppe people located in current northeast China from 207 AD to 907 AD. After the death of their ancestor Tadun in 207 they were no longer called Wuhuan but joined the Khitan Xianbei in submitting to the Yuwen Xianbei. Their history is widely linked to the more famous Khitan. During their history the Kumo Xi engaged in conflict with numerous Chinese dynasties and with the Khitans, eventually suffering a series of disastrous defeats to Chinese armies and coming under the domination of the Khitans. In 1007, the Kumo Xi were completely assimilated into the Khitan Liao Dynasty.', 'title': 'Kumo Xi'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Great Flood of 1862 was the largest flood in the recorded history of Oregon, Nevada, and California, occurring from December 1861 to January 1862. It was preceded by weeks of continuous rains and snows in the very high elevations that began in Oregon in November 1861 and continued into January 1862. This was followed by a record amount of rain from January 9–12, and contributed to a flood that extended from the Columbia River southward in western Oregon, and through California to San Diego, and extended as far inland as Idaho in the Washington Territory, Nevada and Utah in the Utah Territory, and Arizona in the western New Mexico Territory. Immense snowfalls in the mountains of the far western United States caused more flooding in Idaho, Arizona, New Mexico, and Sonora, Mexico the following spring and summer as the snow melted.', 'title': 'Great Flood of 1862'}
