 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ann Cummins is an American fiction writer. She was born in Durango, Colorado, and grew up in New Mexico. She is a graduate of writing programs at Johns Hopkins University and the University of Arizona. She is the author of a short story collection, "Red Ant House" (2003), and a novel, "Yellowcake" (Houghton Mifflin, 2007). Cummins lives in Flagstaff, Arizona, where she teaches creative writing at Northern Arizona University, and in Oakland, California, with her husband, the musician S. E. Willis.', 'title': 'Ann Cummins'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The 1st Regiment California Volunteer Cavalry was a cavalry regiment in the Union Army during the American Civil War. It was first formed of five companies as 1st Battalion, 1st Regiment California Volunteer Cavalry between August and October 31, 1861, at Camp Merchant near Oakland. After the battalion was organized it was sent to Southern California, three companies being stationed at Camp Latham, near Los Angeles, and two at Camp Carleton, near San Bernardino. November 20–29, 1861, a detachment under Second Lt. C. R. Wellman was stationed at Camp Wright, and pursued and captured Dan Showalter's party west of the San Jose Valley and Warner's Ranch. The battalion remained in Southern California until the spring of 1862, when it became part of the California Column, and formed the advance force of that Column during the march to New Mexico Territory and Texas. In 1863, the Regiment was brought to full strength when seven more companies were raised to bring it to a full strength of twelve companies. The five companies first organized were mustered out August 31, 1864, the terms of service of most of the men having expired. Two new companies, B and C, were organized in New Mexico, by consolidation of the few men whose terms had not expired, and by new enlistments, and two new companies were enlisted in California, A and E, which, upon the completion of their organization, were sent to Arizona. All of the companies of First Volunteer Cavalry (Companies B, C, F, G, H, K, and M) stationed in New Mexico and Texas, were ordered to assemble at Baird’s Ranch, near Albuquerque, to be mustered out of the service, during the month of September, 1866. Company M was the last mustered out on the September 30, 1866. 1st Volunteer Cavalry Regiment spent its entire term of service in the western United States in California and New Mexico Territory and Texas.", 'title': '1st California Cavalry Regiment'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Mountain West Conference (MW) is one of the collegiate athletic conferences affiliated with the National Collegiate Athletic Association (NCAA) Division I Football Bowl Subdivision (FBS) (formerly I-A). The MW officially began operations in July 1999. Geographically, the MW covers a broad expanse of the Western United States, with member schools located in California, Colorado, Hawaii, Idaho, Nevada, New Mexico, Utah, and Wyoming. Craig Thompson has served as Commissioner of the MW since its founding in 1999.', 'title': 'Mountain West Conference'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Apache-Sitgreaves National Forest is a 2.76 e6acre United States National Forest which runs along the Mogollon Rim and the White Mountains in east-central Arizona and extending into the U.S. state of New Mexico. Both forests are managed as one unit by USDA Forest Service from the forests Supervisors Office in Springerville, Arizona. Apache-Sitgreaves has over 400 species of wildlife . With its high elevation and cool summer breezes it is a popular weekend destination from the hot desert for Phoenix, Arizona residents. The forest is divided into 5 Ranger Districts (Clifton, Alpine, Springerville, Lakeside, and Black Mesa) that span almost 300 mi from Clifton, Arizona in the east-central portion of Arizona to the eastern boundary of the Coconino National Forest in north-central Arizona. The Apache-Sitgreaves National Forest borders the western and northern borders of the Fort Apache Indian Reservation. It is located in parts of Greenlee, Apache, Navajo, and Coconino counties in eastern and east-central Arizona, and Catron County in western New Mexico. The more northwesterly Sitgreaves National Forest portion lies adjacent to the north side of the Fort Apache Indian Reservation and is located entirely in Arizona, within Navajo, Apache, and Coconino counties. It has a total area of 818,651 acre . The more southeasterly and much larger Apache National Forest portion lies adjacent to the east side of the Fort Apache and the San Carlos Indian Reservations. It lies on both sides of the border with New Mexico, in Greenlee, Catron, and Apache counties. It has a total area of 1,813,601 acre .', 'title': 'Apache-Sitgreaves National Forest'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The Western Athletic Conference (WAC) is an American collegiate athletic conference formed on July 27, 1962 and affiliated with the National Collegiate Athletic Association (NCAA) Division I. The WAC covers a broad expanse of the western United States, with member institutions located in Arizona, California, New Mexico, Utah, and Washington, along with the "non-western" states of Missouri and Illinois (traditionally associated with the Midwest), as well as Texas (traditionally associated with the Southwest).', 'title': 'Western Athletic Conference'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The 1966 Arizona State Sun Devils football team was an American football team that represented Arizona State University in the Western Athletic Conference (WAC) during the 1966 college football season. In their ninth season under head coach Frank Kush, the Sun Devils compiled a 5–5 record (3–2 against WAC opponents), finished in a tie for second place in the WAC, and were outscored by their opponents by a combined total of 174 to 166.', 'title': '1966 Arizona State Sun Devils football team'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Pale Enargia or Aspen Twoleaf Tier ("Enargia decolor") is a moth of the Noctuidae family. It has a boreal-transcontinental distribution, occurring across the Canadian boreal plain and then southward through the western cordillera at higher elevations, where it is presumably limited by the availability of trembling aspen and possibly other poplars. Records range from northernmost British Columbia and south-western Northwest Territories east to New Brunswick. It has also been reported from Nova Scotia, Ohio and New York. In the western United States it is known from western Montana, Idaho, Washington, Oregon, Nevada, Utah, Wyoming (Albany and Carbon counties), western Colorado, New Mexico (Grant Co.), and Arizona (Graham Co.). There are no records from the Rocky Mountain front ranges of Colorado, where it would be expected to be widespread if there is a continuous distribution southward into New Mexico and Arizona. The populations from west of the Rocky Mountains south to New Mexico and Arizona may represent a distinct species.', 'title': 'Enargia decolor'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Phoradendron densum Trel. is a species of flowering plant in the sandalwood family known by the common name dense mistletoe. It is native to the western United States and northwestern Mexico, where it grows in various types of woodland habitat. It has been reported from California, Oregon, Arizona and Baja California. This mistletoe parasitizes species of cypress, including Arizona cypress ("Cupressus arizonica"), and juniper (Juniperus spp.) .', 'title': 'Phoradendron densum'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Ludmila Yevgenyevna Belousova (Russian: Людмила Евгеньевна Белоусова ; 22 November 1935 – 29 September 2017) was a Russian pair skater who represented the Soviet Union. With her partner and husband Oleg Protopopov she was a two-time Olympic champion (1964, 1968) and four-time World champion (1965–1968). In 1979 the pair defected to Switzerland and became Swiss citizens in 1995. They continued to skate at ice shows and exhibitions through their seventies.', 'title': 'Ludmila Belousova'}
