 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Hrant Shahinyan (Armenian: Հրանտ Շահինյան ) (July 30, 1923 – May 29, 1996) also known as Grant Shaginyan was a Soviet Armenian gymnast. Specializing in the still rings and pommel horse, he is a two-time Olympic Champion, two-time World Champion and seven-time USSR Champion.', 'title': 'Hrant Shahinyan'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Oksana (Pasha) Vladimirovna Grishuk (Russian: Оксана (Паша) Владимировна Грищук ; born March 17, 1972) is a Russian former competitive ice dancer. She is best known for her partnership with Evgeni Platov from 1989–1998. With Platov, she is a two-time Olympic champion (1994, 1998), four-time World champion (1994–1997), and three-time European champion (1996–1998). With previous partner Alexandr Chichkov, she is the 1988 World Junior champion.', 'title': 'Oksana Grishuk'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Elena Krykanova, also romanized as Krikanova, (Russian: Елена Крыканова ) is a former ice dancer who represented the Soviet Union. With former partner Evgeni Platov, she is a three-time World Junior champion (1984–1986). They began skating together around December 1976 in Odessa and were coached by Boris Rublev until 1982 when they moved to Moscow to train under Natalia Dubova.', 'title': 'Elena Krykanova'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Yolanda Gail Devers ( ; born November 19, 1966) is an American retired track and field athlete. A two-time Olympic champion in the 100 meters for the USA, her 1996 win made her only the second woman (after Wyomia Tyus) to successfully defend an Olympic 100m title. She won a third Olympic gold medal in the 4 x 100m relay in 1996. She is also the 1993 World champion in the 100m and a three-time World champion in the 100m hurdles. In 2011, she was inducted into the National Track and Field Hall of Fame.', 'title': 'Gail Devers'}
