 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Adam Alavdinovich Batirov (Russian: Адам Алавдинович Бати́ров ; born 13 January 1985 in Dagestan) is an Avar Dagestani-born Russian Naturalized Bahraini freestyle wrestler. He is World Cadet Championships runner-up and Cadet European Champion (2002). Three time Ivan Yarygin winner, National Russian Freestyle wrestling Champion (2007). Senior European Champion. At the 2016 Asian Wrestling Championships he won gold medal, in final match he beat Kumar Vinod of India. Adam is the younger brother of two-time Olympic Champion Mavlet Batirov. After won 2016 World Wrestling Olympic Qualification Tournament 1 he qualified Bahrain for the 2016 Summer Olympics. But he lost in round one to Ikhtiyor Navruzov from Uzbekistan.', 'title': 'Adam Batirov'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Roman Andreyevich Vlasov (Russian: Роман Андреевич Власов ; born 6 October 1990) is a Russian Greco-Roman wrestler. He is a two-time Olympic Champion (2012, 2016), a two-time World Champion (2011, 2015), and a two-time European Champion (2012, 2013). He also won the gold medal at the 2013 Summer Universiade. Furthermore, he was runner-up at the 2013 World Championships and the 2014 and 2015 World Cup. Vlasov trains under Viktor Kuznetsov, the same coach who raised Aleksandr Karelin.', 'title': 'Roman Vlasov'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Randall Scott "Randy" Lewis (born June 7, 1959, in Rapid City, South Dakota) is an American wrestler and olympic champion. He competed at the 1984 Olympic Games in Los Angeles, where he received a gold medal in freestyle featherweight. After winning three high school state titles in South Dakota, he was a four-time All-American and two-time NCAA champion at the University of Iowa. A two-time Olympian, and 1984 Olympic champion in Los Angeles. At Iowa, he was a four-time All-American and two-time NCAA champion. Was member of 1980 Olympic team but President Jimmy Carter\'s boycott prevented the U.S. team from traveling to the Games in Moscow. Won gold medal at 136.5 pounds in freestyle wrestling at 1984 Olympics, outscoring his first four opponents 52-4 to advance to the final, where he crushed Japan\'s Kosei Akaishi 24-11 in 4:52. He was second in the 1988 Olympic trials to John Smith, who wound up winning a gold medal. Lewis was also 1983 Pan American Games champion.', 'title': 'Randy Lewis (wrestler)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'U.S. Bank Tower, formerly Library Tower and First Interstate Bank World Center, is a 1018 ft skyscraper at 633 West Fifth Street in downtown Los Angeles, California. It is the third tallest building in California, the second tallest building in LA, the fifteenth tallest in the United States, the third tallest west of the Mississippi River after the Salesforce Tower and the Wilshire Grand Center, and the 92nd tallest building in the world, after being surpassed by the Wilshire Grand Center. Because local building codes required all high-rise buildings to have a helipad, it was known as the tallest building in the world with a roof-top heliport from its completion in 1989 to 2004 when Taipei 101 opened. It is also the third tallest building in a major active seismic region; its structure was designed to resist an earthquake of 8.3 on the Richter scale. It consists of 73 stories above ground and two parking levels below ground. Construction began in 1987 with completion in 1989. The building was designed by Henry N. Cobb of the architectural firm Pei Cobb Freed & Partners and cost $350 million to build. It is one of the most recognizable buildings in Los Angeles, and often appears in establishing shots for the city in films and television programs.', 'title': 'U.S. Bank Tower (Los Angeles)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Route 3 is a state highway in the northern part of New Jersey in the United States. The route runs 10.84 mi from U.S. Route 46 in Clifton, Passaic County to U.S. Route 1/9 in North Bergen, Hudson County. Route 3 is sometimes called the Secaucus Bypass within Secaucus. The route is a divided highway for its entire length, with most of the highway considered a freeway, except the westernmost part, which contains direct access to a few businesses. Route 3 intersects many major roads, including the Garden State Parkway and Route 21 in Clifton, the western spur of the New Jersey Turnpike (Interstate 95) in East Rutherford, the eastern spur of the New Jersey Turnpike in Secaucus, and Route 495 in North Bergen. A commuting route for northern New Jersey to the Lincoln Tunnel into New York City by way of Route 495, Route 3 also provides access to the Meadowlands Sports Complex in East Rutherford. The road inspired a story in "The New Yorker" in 2004 by Ian Frazier.', 'title': 'New Jersey Route 3'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Upstate New York, broadly defined as a region of the U.S. state of New York north of New York City and Westchester County, is home to several skyscrapers and high-rises. The tallest building in New York State is the 104-story One World Trade Center, which was completed in 2014 and rises to 1776 ft in Lower Manhattan, New York City. New York City, the largest city in the United States, is home to the vast majority of the skyscrapers in New York; outside the city, most of the state's skyscrapers are concentrated in Albany, Buffalo and Rochester. The tallest building in Upstate New York is the 44-story Erastus Corning Tower, which rises 589 ft in Albany, the state's capital city. Although the building is the tallest in the upstate region by a significant margin, it does not appear in the 100-tallest buildings in New York state when New York City skyscrapers are included in the ranking. The second-tallest building in the upstate region is the 529 ft One HSBC Center, which also stands as the tallest building in the city of Buffalo.", 'title': 'List of tallest buildings in Upstate New York'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "This list of tallest buildings in Adelaide ranks the tallest buildings in Adelaide, South Australia by height. The tallest building in Adelaide is currently the 31–story Westpac House, which rises 132 m and was completed in 1988, as of October 2013 it is Australia's 115th tallest building. There are numerous projects either underway or planned in Adelaide, if constructed, Frome Central Tower 1 (11-27 Frome Street) would reach 134 m , therefore becoming the city's tallest building. The tallest approved building in Adelaide is the Sofitel Hotel (104-108 Currie Street), which will be 115 m , it is planned to become the city's second tallest building upon completion. Height restrictions–enforced since the 1990s–have limited the amount of skyscrapers constructed in the city although they have been eased in recent times.", 'title': 'List of tallest buildings in Adelaide'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'U.S. Bank Center is a skyscraper located in downtown Milwaukee, Wisconsin, noted for being the tallest building in the state of Wisconsin, and the tallest building between Chicago and Minneapolis. Standing 601 ft and 42 stories tall, the building has a floor area of 1,077,607 ft2 and it surpassed the Milwaukee City Hall as both the tallest building in the city and the state. Topped off August 29, 1972, and completed in 1973, it was the headquarters for what eventually became Firstar Corporation from 1973 to 2001. The building was designed by Bruce Graham and James DeStefano of Skidmore, Owings & Merrill and engineered by Fazlur Rahman Khan. s of 2017 , the building is home to the headquarters of Foley & Lardner, Robert W. Baird & Company, Sensient Technologies Corporation, and is the Milwaukee office for U.S. Bank, IBM, KPMG, and CBRE.', 'title': 'U.S. Bank Center (Milwaukee)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "This list of tallest buildings in Indianapolis ranks skyscrapers and high-rises in the U.S. city of Indianapolis, Indiana, by height. Majority of the skyscrapers are located in Downtown Indianapolis. The tallest building in the city is the 49-story SalesforceTower, which rises 811 ft and was completed in 1990. The structure is the tallest completed building in the state and the 49th-tallest building in the U.S. In addition, it is the tallest building in the Midwest outside of Chicago and Cleveland. The city's second tallest structure is the OneAmerica Tower, which was the tallest building in Indiana from 1982 until 1990. Of the 40 tallest buildings in Indiana, 34 are located in Indianapolis.", 'title': 'List of tallest buildings in Indianapolis'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'City Hall Plaza, City Hall Plaza Tower or 900 Elm Street (U.S. Route 3), is a prominent 275 ft office tower in Manchester, New Hampshire. Since its completion in 1992, City Hall Plaza has been the tallest building in the city of Manchester, the state of New Hampshire, and northern New England (the states of New Hampshire, Maine, and Vermont). It is shorter than most of the tallest buildings in Boston, Hartford, New Haven, and Providence. The tower is used as office space for private businesses and for the Manchester city government.', 'title': 'City Hall Plaza (Manchester)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "This list of tallest buildings in Corpus Christi ranks high-rises in the U.S. city of Corpus Christi, Texas by height. The tallest building in Corpus Christi is the 28-story One Shoreline Plaza South Tower, which rises 411 feet (125 m) and was completed in 1988. It also stands as the tallest building in Texas south of San Antonio. The building is located on a complex which also contains the second tallest building in the city at 375 feet (114 m). The third tallest building is the Frost Bank Plaza. It stood as the city's tallest building from 1983 to 1988.", 'title': 'List of tallest buildings in Corpus Christi'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Brady Sullivan Plaza, formerly known as the Hampshire Plaza, is a 259 ft , 20-story high-rise located at 1000 Elm Street, Manchester, New Hampshire. For 20 years, from its completion in 1972 until the completion of the 275 ft One City Hall Plaza at 900 Elm Street in 1992, it was the tallest building in the U.S. state of New Hampshire and in northern New England. The building is recognizable as a box-shaped structure, with black tinted windows and black architectural features.', 'title': 'Brady Sullivan Plaza'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Pittsburg-Chartierville Border Crossing connects the towns of Chartierville, Quebec and Pittsburg, New Hampshire. The crossing can be reached by U.S. Route 3 on the American side and by Quebec Route 257 on the Canadian side. It is the only international land border crossing in the state of New Hampshire. Pittsburg is notable for being the largest township (in terms of land area) in the continental United States. Although the US operated a border station at Connecticut Lakes as far back as the 1930s, the facility consisted of a small one-room structure, and later a mobile home. The US did not have a permanent inspection facility at the border until 1960, and the northernmost stretch of U.S. Route 3 remained unpaved until about 1970. In 2012, the United States built a new border inspection facility.', 'title': 'Pittsburg-Chartierville Border Crossing'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Marx Reloaded is a 2011 German documentary film written and directed by the British writer and theorist Jason Barker. Featuring interviews with several well-known philosophers, the film aims to examine the relevance of Karl Marx\'s ideas in relation to the Great Recession. The film\'s title is a wordplay on "The Matrix Reloaded", the sequel to "The Matrix," which is parodied in the documentary.', 'title': 'Marx Reloaded'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Marx in Soho is a 1999 one-man play written by American historian Howard Zinn, about the life of 19th-century philosopher Karl Marx. Zinn wrote the play to "show Marx as few people knew him, as a family man, struggling to support his wife and children." The play is set in the New York City neighborhood of Soho, a humorous nod to the London neighborhood of the same name in which Marx spent much of his life.', 'title': 'Marx in Soho'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Private Life of Louis XIV or Liselotte of the Palatinate (German:Liselotte von der Pfalz) is a 1935 German historical film directed by Carl Froelich and starring Renate Müller, Eugen Klöpfer and Maria Krahn. The film\'s English language release title is a reference to the hit British film "The Private Life of Henry VIII" (1933).', 'title': 'The Private Life of Louis XIV'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Private Life of the Kingfisher (styled in its opening titles as "The private life of the KINGFISHER), made in 1966 and screened in 1967 as episode 144 of the nature series "Look", was the first BBC natural history film to be shown in colour.', 'title': 'The Private Life of the Kingfisher'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Une double famille ("A Second Home") is a lengthy short story by Honoré de Balzac, which first appeared in 1830 under the title "La femme vertueuse" ("The Virtuous Woman"). It was subsequently published in 1832 by Mame et Delaunay as part of Balzac\'s "Scènes de la vie privée" ("Scenes from Private Life"). In 1835 it appeared, in an edition by Madame Béchet, in the collection "Études de mœurs" ("Studies of Manners"). The novel only acquired its present title in 1842, when the fifth edition appeared in Volume I of the "Scenes from Private Life", which was also the first volume of Balzac\'s "La Comédie humaine".', 'title': 'Une double famille'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Work–life interface is the intersection of work and private life. There are many aspects of one's personal life that can intersect with work including family, leisure, and health. Work–life interface is bidirectional; for instance, work can interfere with private life, and private life can interfere with work. This interface can be adverse in nature (e.g., work-life conflict) or can be beneficial (e.g., work-life enrichment) in nature.", 'title': 'Work–life interface'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The Private Life of Plants is a BBC nature documentary series written and presented by David Attenborough, first shown in the United Kingdom from 11 January 1995.', 'title': 'The Private Life of Plants'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Groucho: A Life in Revue is a stage play written by Groucho Marx\'s son Arthur Marx and Robert Fisher . With musical direction by Jim Grady. It is a look at the life and career of the famous entertainer Groucho Marx of the Marx Brothers and "You Bet Your Life" fame. It opened off-Broadway at the Lucille Lortel Theatre on October 8, 1986 and played 254 performances closing on May 3, 1987. It starred 23-year-old actor Frank Ferrante as Groucho Marx from age 15 to 85, Les Marsden as Harpo Marx and Chico Marx, Faith Prince as The Girls and Rusty Magee as The Citizen of Freedonia. It was directed by Arthur Marx. The play opened to rave reviews. " The New York Times" wrote, "There is laughter in abundance" and described Ferrante\'s performance as "artful...his timing is digital sharp." The "New York Post" dubbed it "hilarious...a brilliant revue." "Groucho" was nominated for two NY Outer Critics Circle Awards - one for Best Play and one for Ferrante\'s performance. Ferrante won a 1987 New York Theatre World Award for \'Outstanding New Talent.\' The play was produced by Nancy and Ronnie Horowitz.', 'title': 'Groucho: A Life in Revue'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Leonard Marx (March 22, 1887 – October 11, 1961), known professionally as Chico Marx, was an American comedian, musician, bandleader, actor and film star. He was a member of the Marx Brothers (Groucho Marx, Harpo Marx, and Zeppo Marx). His persona in the act was that of a charming, dim-witted albeit crafty con artist, seemingly of rural Italian origin, who wore shabby clothes and sported a curly-haired wig and Tyrolean hat. In virtually every film that includes the main trio of the Marx Brothers, Chico is seen working with Harpo Marx, usually as partners in crime. Leonard was the oldest of the Marx Brothers to live past early childhood (first-born Manfred Marx had died in infancy). In addition to his work as a performer, he played an important role in the management and development of the act in its early years.', 'title': 'Chico Marx'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Private Life of the Gannets is a 1934 British short documentary film, directed by Julian Huxley, about a colony of Northern Gannet (Morus bassanus) on the small rocky island of Grassholm, off the coast of Wales. It received a special mention at the 3rd Venice International Film Festival in 1935 and won the Best Short Subject (One-Reel) at the 10th Academy Awards in 1938. The title was chosen by producer Alexander Korda as a reference to "The Private Life of Henry VIII" (1933), his breakthrough film of the previous year.', 'title': 'The Private Life of the Gannets'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Holy Sonnets—also known as the Divine Meditations or Divine Sonnets—are a series of nineteen poems by the English poet John Donne (1572–1631). The sonnets were first published in 1633—two years after Donne's death. The poems are sonnets and are predominantly in the style and form prescribed by Renaissance Italian poet Petrarch (or Francesco Petrarca) (1304–1374) in which the sonnet consisted of two quatrains (four-line stanzas) and a sestet (a six-line stanza). However, several rhythmic and structural patterns as well as the inclusion of couplets are elements influenced by the sonnet form developed by English poet and playwright William Shakespeare (1564–1616).", 'title': 'Holy Sonnets'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'William Shakespeare (1564–1616) was an English poet and playwright. He wrote approximately 38 plays and 154 sonnets, as well as a variety of other poems.', 'title': 'Shakespeare bibliography'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Henry Carey (c. 26 August 1687 – 5 October 1743) was an English poet, dramatist and song-writer. He is remembered as an anti-Walpolean satirist and also as a patriot. Several of his melodies continue to be sung today, and he was widely praised in the generation after his death. Because he worked in anonymity, selling his own compositions to others to pass off as their own, contemporary scholarship can only be certain of some of his poetry, and a great deal of the music he composed was written for theatrical incidental music. However, under his own name and hand, he was a prolific song writer and balladeer, and he wrote the lyrics for almost all of these songs. Further, he wrote numerous operas and plays. His life is illustrative of the professional author in the early 18th century. Without inheritance or title or governmental position, he wrote for all of the remunerative venues, and yet he also kept his own political point of view and was able to score significant points against the ministry of the day. Further, he was one of the leading lights of the new "Patriotic" movement in drama.', 'title': 'Henry Carey (writer)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Samuel Taylor Coleridge ( ; 21 October 177225 July 1834) was an English poet, literary critic, philosopher and theologian who, with his friend William Wordsworth, was a founder of the Romantic Movement in England and a member of the Lake Poets. He wrote the poems "The Rime of the Ancient Mariner" and "Kubla Khan", as well as the major prose work "Biographia Literaria". His critical work, especially on William Shakespeare, was highly influential, and he helped introduce German idealist philosophy to English-speaking culture. Coleridge coined many familiar words and phrases, including suspension of disbelief. He was a major influence on Ralph Waldo Emerson and American transcendentalism.', 'title': 'Samuel Taylor Coleridge'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'As the last in the famed collection of sonnets written by English poet and playwright William Shakespeare from 1592 to 1598, Sonnet 154 is most often thought of in a pair with the previous sonnet, number 153. As A. L. Rowse states in "Shakespeare\'s Sonnets: The Problems Solved", Sonnets 153 and 154 "are not unsuitably placed as a kind of coda to the Dark Lady Sonnets, to which they relate." Rowse calls attention to the fact that Sonnets 153 and 154 "serve quite well to round off the affair Shakespeare had with Emilia, the woman characterized as the Dark Lady, and the section of the Dark Lady sonnets". Shakespeare used Greek mythology to address love and despair in relationships. The material in Sonnets 153 and 154 has been shown to relate to the six-line epigram by the Byzantine poet known as Marianus Scholasticus, who published a collection of 3,500 poems called "The Greek Anthology". When translated, the epigram resembles Sonnets 153 and 154, addressing love and the story of Cupid, the torch, and the Nymph\'s attempt to extinguish the torch.', 'title': 'Sonnet 154'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'William Shakespeare ( ; 26 April 1564 (baptised)\xa0– 23 April 1616) was an English poet, playwright, and actor, widely regarded as the greatest writer in the English language and the world\'s pre-eminent dramatist. He is often called England\'s national poet, and the "Bard of Avon". His extant works, including collaborations, consist of approximately 38 plays, 154 sonnets, two long narrative poems, and a few other verses, some of uncertain authorship. His plays have been translated into every major living language and are performed more often than those of any other playwright.', 'title': 'William Shakespeare'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The Tempest is a 1979 film adaptation of William Shakespeare\'s play of the same name. Directed by Derek Jarman, with Heathcote Williams as Prospero, it also stars Toyah Willcox, Jack Birkett and Helen Wellington-Lloyd from Jarman\'s previous feature, "Jubilee" (1977), as well as his long-time cohort Karl Johnson.', 'title': 'The Tempest (1979 film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Charles Goodall (1671—May 11, 1689) is a minor English poet. A student of Eton College and then Merton College, Oxford, he wrote a number of romantic and erotic poems referring to male students at said colleges. In 1689, the year of his death, he put together a collection entitled "Poems and Translations" which contains 33 poems with male-male subject matter, eleven regarding women, and 13 to a mistress named \'Idera\' (considered probably imaginary). A number of the homoerotic poems have been rewritten to remove the same-sex subject matter.', 'title': 'Charles Goodall (poet)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'John Henley Heathcote-Williams (15 November 1941 – 1 July 2017), known as Heathcote Williams, was an English poet, actor, political activist and dramatist. He wrote a number of book-length polemical poems including "Autogeddon", "Falling for a Dolphin" and "Whale Nation", which in 1988 became, according to Philip Hoare, "the most powerful argument for the newly instigated worldwide ban on whaling." Williams invented his idiosyncratic "documentary/investigative poetry" style which he put to good purpose bringing a diverse range of environmental and political matters to public attention. His last published work, "American Porn" was a critique of the American political establishment and the election of President Donald Trump: Publication date was the date of Trump\'s inauguration (20 January 2017). In June 2015, he published a book-length investigative poem about the "Muslim Gandhi", Khan Abdul Ghaffar Khan, "Badshah Khan".', 'title': 'Heathcote Williams'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Isabella Cervoni (Colle Val d\'Elsa, 1575–1600) was an Italian poet of the Counter-Reformation period, active between 1590 and 1600. She wrote encomiastic and polemical poems addressed to numerous secular and religious dignitaries of the Italian Renaissance, including Pope Clement VIII, Maria de\' Medici, Christina of Lorraine and Henry IV of France. She was praised for her talent and ambition by Cristoforo Bronzini in his 1625 dialogue "Della dignità delle donne, dialogo…settimana prima e giornata quarta" as having "given the world many beautiful and spiritual compositions" despite her "most tender age."', 'title': 'Isabella Cervoni'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Dance is the seventh studio album by Keller Williams, released in 2003. It contains remixes of songs from his preceding album, Laugh.', 'title': 'Dance (Keller Williams album)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "N.W.U is a 2016 Japanese-language album by South Korean rock band F.T. Island and is the band's seventh Japanese studio album. N.W.U is an acronym of 'Naite' (泣いて, to cry), 'Waratte' (笑って, to laugh), 'Utatte' (歌って, to sing). The album was released on 6 April 2016 and became top selling album that week in Japan's Tower Records.", 'title': 'N.W.U'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Live! is a live album by American rock group The Beau Brummels. The album, released in August 2000 by Dig Music, was recorded in February 1974 near Sacramento, California, shortly after it was announced that the band had reunited. The album includes a mix of performances of their most commercially singles, including "Laugh, Laugh" and "Just a Little," as well as then-new material, some of which would be recorded for the band\'s 1975 eponymous studio album.', 'title': 'Live! (The Beau Brummels album)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Dance and Laugh Amongst the Rotten is the fifth studio album by Dutch symphonic black metal band Carach Angren. It was released on June 16, 2017 via Season of Mist.', 'title': 'Dance and Laugh Amongst the Rotten'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The discography of Suicidal Tendencies, a Los Angeles-based crossover thrash band formed in 1980 by vocalist Mike Muir, consists of twelve studio albums, four compilation albums, one extended play, eighteen singles and twenty-two music videos. Their first studio album, "Suicidal Tendencies", was released in 1983 but failed to chart. Their second album, "Join the Army", was released four years later and peaked at number 100 in the United States and number 81 in the UK. The album caught the attention of Epic Records, who signed Suicidal Tendencies in 1988. The band released their first album for the label, "How Will I Laugh Tomorrow When I Can\'t Even Smile Today", in September 1988, and in the following year they released "Controlled by Hatred/Feel Like Shit...Déjà Vu", which was their first album to be certified gold by the Recording Industry Association of America (RIAA).', 'title': 'Suicidal Tendencies discography'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Laugh Now, Laugh Later is the seventh studio album by American punk rock band Face to Face, which was released on May 17, 2011 through Antagonist Records, a label run by the band\'s lead singer and guitarist Trever Keith. It marks 9 years since the release of Face to Face\'s previous studio album "How to Ruin Everything" in 2002. It is their first release with second guitarist Chad Yaro in 11 years, since 2000\'s "Reactionary".', 'title': 'Laugh Now, Laugh Later'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Rotten Agenda is the third and final studio album by the American hardcore punk band Aus-Rotten, released in 2001 on Rotten Propaganda Records. The record label bears the name of lead vocalist/lyricist Dave Trenga\'s anarchist DIY newspaper "Rotten Propaganda".', 'title': 'The Rotten Agenda'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Carach Angren ( ) is a symphonic black metal band from the Netherlands, formed by two members of the now-defunct bands Inger Indolia and Vaultage. They have three steady members with previously frequent guest appearances for the violin parts. Their style is characterized by prominent use of orchestral arrangements. All of their studio albums are concept albums with lyrics based on ghost stories and folk lore, such as "Flying Dutchman". They set themselves apart from other symphonic black metal artists in showcasing songs often using multiple languages apart from English, such as French, German and Dutch, though every song does use English as a baseline and certain choruses or sections will make the transition.', 'title': 'Carach Angren'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Wish You Were Here is the second studio album of American country music artist Mark Wills. Released on May 5, 1998, on Mercury Nashville Records, the album produced four singles on the "Billboard" Hot Country Singles & Tracks (now Hot Country Songs) charts, all of which made top 10: "I Do (Cherish You)", "Don\'t Laugh at Me", "Wish You Were Here", and "She\'s in Love". The album itself peaked at #8 on the "Billboard" Top Country Albums charts and #74 on The Billboard 200. It also received RIAA platinum certification for U.S. sales of one million copies.', 'title': 'Wish You Were Here (Mark Wills album)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Don\'t Laugh Now was Ray Stevens\' nineteenth studio album and his third and final for RCA Records, released in 1982. The front of the album cover shows Stevens looking pensive and holding a comedy mask, while the back cover shows Stevens smiling and holding a tragedy mask. Two singles were lifted from the album: "Written Down in My Heart" and "Where the Sun Don\'t Shine," both of which became minor country hits.', 'title': "Don't Laugh Now"}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Tommy Swerdlow is an American actor and screenwriter. He has appeared in such films as "Howard the Duck" (1986) and "Spaceballs" (1987) and co-wrote the screenplays of "Cool Runnings" (1993), "Little Giants" (1994) and "Snow Dogs" (2002). Swerdlow made his directorial debut with the 2017 feature "A Thousand Junkies". He has also written a biopic about the life of Matisyahu titled "King Without a Crown".', 'title': 'Tommy Swerdlow'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'National Treasure is a 2004 American adventure heist film produced and released by Walt Disney Pictures. It was written by Jim Kouf and the Wibberleys, produced by Jerry Bruckheimer and directed by Jon Turteltaub. It is the first film in the "National Treasure" franchise and stars Nicolas Cage, Harvey Keitel, Jon Voight, Diane Kruger, Sean Bean, Justin Bartha and Christopher Plummer.', 'title': 'National Treasure (film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Trabbi Goes to Hollywood (English title: Driving Me Crazy) is a 1991 US comedy film directed by Jon Turteltaub, starring Thomas Gottschalk, Billy Dee Williams, Dom DeLuise, and James Tolkan.', 'title': 'Trabbi Goes to Hollywood'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Last Vegas is a 2013 American comedy film directed by Jon Turteltaub, written by Dan Fogelman and starring Michael Douglas, Robert De Niro, Morgan Freeman, Kevin Kline and Mary Steenburgen. The plot surrounds three retirees who travel to Las Vegas to have a bachelor party for their last remaining single friend.', 'title': 'Last Vegas'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Meg is an upcoming American science fiction action horror film directed by Jon Turteltaub and written by Dean Georgaris. It is based on the 1997 science fiction book "" by Steve Alten. The film stars Jason Statham, Jessica McNamee, Li Bingbing, Ruby Rose, Rainn Wilson, Cliff Curtis, and Robert Taylor. The film will be released by Warner Bros. on August 10, 2018.', 'title': 'Meg (film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Think Big is a 1990 adventure/comedy film directed by Jon Turteltaub starring the "Barbarian Brothers" Peter and David Paul. The film follows the misadventures of a pair of twin brother truck drivers who aide a teenage runaway. Also features cameos from character actors such as Michael Winslow, Richard Moll, Richard Kiel.', 'title': 'Think Big (film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '3 Ninjas is a 1992 American martial arts comedy film directed by Jon Turteltaub, starring Victor Wong, Michael Treanor, Max Elliott Slade, and Chad Power. It was the only "3 Ninjas "film released by Touchstone Pictures, while the others were released by TriStar Pictures. The film is about three young brothers who learn martial arts from their Japanese grandfather.', 'title': '3 Ninjas (film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'National Treasure: Book of Secrets (released on home video as National Treasure 2: Book of Secrets) is a 2007 mystery adventure film directed by Jon Turteltaub and produced by Jerry Bruckheimer. It is a sequel to the 2004 film "National Treasure" and is the second part of the "National Treasure" franchise. The film stars Nicolas Cage, Diane Kruger, Justin Bartha, Jon Voight, Harvey Keitel, Ed Harris, Bruce Greenwood, and Helen Mirren.', 'title': 'National Treasure: Book of Secrets'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Cool Runnings is a 1993 American comedy sports film directed by Jon Turteltaub and starring Leon, Doug E. Doug, Rawle D. Lewis, Malik Yoba and John Candy. The film was released in the United States on October 1, 1993. It was Candy\'s third to last film of his career and the last of his films to be released during his lifetime. It is loosely based on the true story of the Jamaica national bobsleigh team\'s debut in competition during the 1988 Winter Olympics in Calgary, Alberta, Canada. The film received positive reviews, and the film\'s soundtrack also became popular with Jimmy Cliff\'s cover of "I Can See Clearly Now" reaching the top 40 as a single in nations such as Canada, France, and the UK.', 'title': 'Cool Runnings'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "A Thousand Junkies is a 2017 American comedy-drama film directed by and starring Tommy Swerdlow. It is Swerdlow's directorial debut.", 'title': 'A Thousand Junkies'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Wolfgang Heinz Porsche (born Stuttgart May 10, 1943) is a German manager and a member of the Porsche family dynasty. He is a shareholder and chairman of the Supervisory Board of Porsche Automobil Holding SE as well as of Porsche AG. He is the youngest son of Ferdinand (Ferry) Porsche and Dorothea Reitz. His oldest brother is Ferdinand (Butzi) Porsche, designer of the Porsche 911.', 'title': 'Wolfgang Porsche'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Louise Hedwig Anna Wilhelmine Piëch (née Porsche; 29 August 1904, in Wiener Neustadt – 10 February 1999, in Zell am See) was the daughter of automotive pioneer Ferdinand Porsche. In 1928, she married Anton Piëch, a lawyer from Vienna who from 1941 to 1945 led the KdF-Wagen (Volkswagen) factory in KdF-Stadt (present day Wolfsburg).', 'title': 'Louise Piëch'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Porsche Automobil Holding SE, usually shortened to Porsche SE (] ), is a German holding company with investments in the automotive industry. Porsche SE is headquartered in Zuffenhausen, a city district of Stuttgart, Baden-Württemberg and is owned by the Porsche and Piëch families. The company was founded in Stuttgart as "Dr. Ing. h.c. F. Porsche GmbH" in 1931 by Ferdinand Porsche (1875–1951) and his son-in-law Anton Piëch (1894–1952).', 'title': 'Porsche SE'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Ferdinand Anton Ernst Porsche (19 September 1909\xa0– 27 March 1998), mainly known as Ferry Porsche, was an Austrian technical automobile designer and automaker-entrepreneur. He operated Porsche AG in Stuttgart, Germany. His father, Ferdinand Porsche, Sr. was also a renowned automobile engineer and founder of Volkswagen and Porsche. His nephew, Dr. Ferdinand Piëch, is the longtime chairman of Volkswagen Group, and his son, Ferdinand Alexander Porsche, was involved in the design of the 911.', 'title': 'Ferdinand Anton Ernst Porsche'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Porsche 356/1 was the first real Porsche car created by Ferdinand "Ferry" Porsche. This prototype car was a two-seater open roadster with a mid-mounted, air-cooled flat-4 engine of 1,131 cc displacement that produced 40 hp . While the body was an original design, most of the mechanicals (including engine and suspension) were derived from the Volkswagen Beetle which Ferry\'s father, Ferdinand Porsche, had designed.', 'title': 'Porsche 356/1'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Ferdinand Porsche (3 September 1875\xa0– 30 January 1951) was an automotive engineer and founder of the Porsche car company. He is best known for creating the first gasoline-electric hybrid vehicle (Lohner-Porsche), the Volkswagen Beetle, the Mercedes-Benz SS/SSK, several other important developments and Porsche automobiles. In addition, Porsche designed the 1923 Benz Tropfenwagen, which was the first racing car with a mid-engine, rear-wheel drive layout.', 'title': 'Ferdinand Porsche'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Ferdinand Alexander Porsche (11 December 1935\xa0– 5 April 2012), nicknamed "Butzi", son of Ferry Porsche, grandson of Ferdinand Porsche, was a German designer whose best known product was the first Porsche 911.', 'title': 'Ferdinand Alexander Porsche'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ferdinand Oliver Porsche (born 13 March 1961 in Stuttgart) is a German lawyer and member of the Supervisory Board of the German sports car manufacturer Porsche. Son of Ferdinand Alexander Porsche and great-grandson of automotive pioneer Ferdinand Porsche, he completed his M. A. studies in Law, Publishing, and Political Science at the University of Salzburg, subsequently taking his Doctor’s Degree in Law and his MBA at the University of Miami.', 'title': 'Ferdinand Oliver Porsche'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Porsche P1, otherwise known as the Egger-Lohner electric vehicle, C.2 Phaeton model, is the world's first Porsche. It is designed by Ferdinand Porsche and is considered to be the first stepping stone for him before he and his son created the company, Porsche. The vehicle resembles a wooden crate or an old horse-drawn carriage but it is actually an electrically motored vehicle.", 'title': 'Porsche P1'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Porsche family is a prominent Austrian family of industrialists descending from the automotive pioneer Ferdinand Porsche. Its members have full ownership of the Porsche SE automobile corporation and majority voting rights of the Volkswagen AG, the biggest automaker in the world.', 'title': 'Porsche family'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'STATPHYS is an international conference on statistical physics of the International Union of Pure and Applied Physics (IUPAP). The series of conferences take place every three years in a different continent to give the maximum international relevance and visibility to the event. It is the world event for the broad field of statistical physics and all its interdisciplinary developments. The first meeting was in Florence in 1948. After a pioneering period the periodicity of three years was established and the conference has acquired more and more importance. The participation has reached peaks up to 1500 participants in the recent years. Also on the occasion of this conference the prestigious Boltzmann medal is awarded. In addition several satellite meetings are usually held along with the main event, adding to the scientific value of the meeting. The upcoming 25th STATPHYS meeting will be held from July 22 to July 26, 2013 in Seoul, Korea .', 'title': 'Statphys'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Constitution of Cúcuta, also known as Constitution of the Gran Colombia and Constitution of 1821, was the founding document and constitution of the country of Gran Colombia, unifying the territories of the Viceroyalty of New Granada as part of a federation. It was signed during the Congress of Cúcuta on August 30, 1821.', 'title': 'Colombian Constitution of 1821'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Best in the World '15 was a professional wrestling pay-per-view event produced by Ring of Honor that took place at Terminal 5 in New York City, New York on June 19, 2015. It was the sixth annual ROH Best in the World event, the first to take place on a Friday, and the second Best in the World event to be broadcast on traditional pay-per-view outlets.", 'title': "Best in the World '15"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Prayer Book Society of Canada or PBS is an organization within the Anglican Church of Canada which "promotes the understanding and use of the Book of Common Prayer as a spiritual system of nurture for life in Christ". Founded in 1985, the PBS seeks to "ensure the retention of the doctrine and worship of the Book of Common Prayer as required by the Solemn Declaration of 1893, the founding document of the autonomous Anglican Church of Canada."', 'title': 'Prayer Book Society of Canada'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The "Declaration and Address" was written by Thomas Campbell in 1809. It was first published in Washington, Pennsylvania in 1809. It was the founding document for the Christian Association of Washington, a short lived religious movement of the 19th century. The Christian Association ultimately led to what is now known as the Restoration Movement. In many ways, Thomas Campbell was before his time. He had an ecumenical spirit long before the ecumenical movement began. The "Declaration and Address" is a testimony to his appeal for Christian unity.', 'title': 'Declaration and Address'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Declaration of Independence of the Mexican Empire (Spanish: "Acta de Independencia del Imperio Mexicano" ), is the document by which the Mexican Empire declared independence from the Spanish Empire. This founding document of the Mexican nation was drafted in the National Palace in Mexico City on September 28, 1821, by Juan José Espinosa de los Monteros, secretary of the Provisional Governmental Board.', 'title': 'Declaration of Independence of the Mexican Empire'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The 1st World Outgames took place in Montreal, Quebec, Canada from July 26, 2006 to August 5, 2006. The international conference was held from July 26 to the 29. The sporting events were held from July 29 to August 5.', 'title': '2006 World Outgames'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The ASEAN Declaration or Bangkok Declaration is the founding document of Association of Southeast Asian Nations (ASEAN). It was signed in Bangkok on 8 August 1967 by the five ASEAN founding members, Indonesia, Malaysia, Philippines, Singapore, and Thailand as a display of solidarity against communist expansion in Vietnam and communist insurgency within their own borders. It states the basic principles of ASEAN: co-operation, amity, and non-interference. The date is now celebrated as ASEAN Day.', 'title': 'ASEAN Declaration'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The Declaration of Montreal on Lesbian, Gay, Bisexual, and Transgender Human Rights is a document adopted in Montreal, Quebec, Canada, on July 29, 2006, by the International Conference on LGBT Human Rights which formed part of the first World Outgames. The Declaration outlines a number of rights and freedoms pertaining to LGBT and intersex people that it is proposed be universally guaranteed. It encompasses all aspects of human rights, from the guarantee of fundamental freedoms to the prevention of discrimination against LGBT people in healthcare, education and immigration. The Declaration also addresses various issues that impinge on the global promotion of LGBT rights and intersex human rights. Intended as a starting point in listing the demands of the international LGBT movement, it will ultimately be submitted to the United Nations.', 'title': 'Declaration of Montreal'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Warsaw Declaration "Toward a Community of Democracies" is the founding document of the Community of Democracies. It was signed on June 27, 2000 at the building of the Polish Parliament by representatives of 106 democratic states attending the opening conference of the Community of Democracies.', 'title': 'Warsaw Declaration'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The David Gates Songbook is a compilation album by David Gates of Bread. It consists of previously released as well as new solo material; and songs with his former band Bread.', 'title': 'The David Gates Songbook'}
