 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Never Let Her Go is the second solo album by David Gates of Bread.', 'title': 'Never Let Her Go'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Aubrey" is a song written and composed by David Gates, and originally recorded by the pop-rock group Bread, of which Gates was the leader and primary music producer. It appeared on Bread\'s 1972 album "Guitar Man." The single lasted 11 weeks on the "Billboard" Hot 100 chart, peaking at number 15. In Canada the song reached only number 41 on the pop singles chart, but reached number six on the adult contemporary chart. In New Zealand, "Aubrey" reached number eight.', 'title': 'Aubrey (song)'}
