 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Goodbye Girl is the third solo album by David Gates of Bread. The song "Goodbye Girl" was also used in the movie of the same name.', 'title': 'Goodbye Girl (David Gates album)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"The Guitar Man" is a song written by David Gates and originally recorded by the rock group Bread, of which Gates was a member. It first appeared on Bread\'s 1972 album, "Guitar Man". The song is a mixture of the sounds of soft rock, including strings and acoustic guitar, and the addition of a wah-wah effect electric guitar, played by Larry Knechtel. It peaked at number 11 on the "Billboard" Hot 100 chart in the United States and their third number-one hit on the easy listening chart, (following "If" and "Baby I\'m-a Want You").', 'title': 'The Guitar Man'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Lost Without Your Love" is a song written and composed by David Gates, and originally recorded by the pop-rock group Bread, of which Gates was the leader and primary music producer. It is the title track of Bread\'s 1976 album, and became their final Top 10 hit.', 'title': 'Lost Without Your Love (song)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Falling in Love Again is the fourth solo album by David Gates of Bread.', 'title': 'Falling in Love Again (David Gates album)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Transporter 3 (French: Le Transporteur 3) is a 2008 French action film and the third installment in the "Transporter" franchise. Both Jason Statham and François Berléand reprise their roles, as Frank Martin and Tarconi, respectively. This is the first film in the series to be directed by Olivier Megaton. The film continues the story of Frank Martin, a professional "transporter" who has returned to France to continue his low-key business of delivering packages without question.', 'title': 'Transporter 3'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Brody Sweeney is an Irish businessman, known for founding O\'Briens Irish Sandwich Bars which went into Liquidation in October 2009. The Irish business was subsequently bought from the liquidator by Abrakebabra Investments Ltd. Prior to that he was involved with the franchise Prontoprint before selling the business back to the U.K. parent in 1988. He has written two business guides, "Making Bread" and "Small to Tall" - How to grow your business from its entrepreneurial roots". He founded a Thai takeaway business, Camile Thai Kitchen, in 2010 with branches in Dublin, Ireland.', 'title': 'Brody Sweeney'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ciara-Camile "Camile" Roque Velasco (born September 1, 1985) known by her stage name Eli-Mac is a Filipino American singer and came in ninth place on the third season of the reality/talent-search television series, American Idol. She is one-quarter Irish, one-quarter Spanish, and half Filipino.', 'title': 'Camile Velasco'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'In the post-production process of film editing and video editing, a cut is an abrupt, but usually trivial film transition from one sequence to another. It is synonymous with the term "edit", though "edit" can imply any number of transitions or effects. The cut, dissolve and wipe serve as the three primary transitions. The term refers to the physical action of cutting film or videotape, but also refers to a similar edit performed in software; it has also become associated with the resulting visual "break".', 'title': 'Cut (transition)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Transporter Refueled (French: Le Transporteur : Héritage) is a 2015 French action film directed by Camille Delamarre and written by Bill Collage, Adam Cooper, and Luc Besson. It is the fourth film in the "Transporter" franchise, a reboot to the previous films, and the first film to be distributed by EuropaCorp in North America, but features a new cast, with Ed Skrein replacing Jason Statham as the title role of Frank Martin. It is the first installment of a planned "Transporter" reboot trilogy.', 'title': 'The Transporter Refueled'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Camilo Alberto Pascual Lus (born January 20, 1934) is a Cuban former Major League Baseball right-handed pitcher. During an 18-year baseball career (1954–71), he played for the Washington Senators (which became the Minnesota Twins in 1961), the second Washington Senators franchise, Cincinnati Reds, Los Angeles Dodgers, and the Cleveland Indians. He was also known by the nicknames "Camile" and "Little Potato."', 'title': 'Camilo Pascual'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Star Wars Episode I.I: The Phantom Edit is a fan edit of the film "", removing many elements of the original film. The purpose of the edit, according to creator Mike J. Nichols, was to make a much stronger version of "The Phantom Menace" based on the previous execution and philosophies of film storytelling and editing of George Lucas. "The Phantom Edit" was the first unauthorized re-edit of "The Phantom Menace" to receive major publicity and acclaim.', 'title': 'The Phantom Edit'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Berserk: The Golden Age Arc (Japanese: ベルセルク 黄金時代篇 , Hepburn: Beruseruku Ōgon Jidai-hen ) is a series of films, an effort to adapt the Golden Age Arc of Kentaro Miura\'s "Berserk" manga series. The project was first announced as a new anime project in September 2010 on a wraparound jacket band on volume 35 of the "Berserk" manga. The first two films, "Berserk: The Golden Age Arc I - The Egg of the King" and "Berserk: The Golden Age Arc II - The Battle for Doldrey", were released in Japan in February and June 2012, with the third film, "Berserk: The Golden Age Arc III - The Advent", released in February 2013. The third film also marks the first time new footage based on the manga has been animated beyond the storyline of the TV show. Viz Media has licensed all three films for a home video release. The first film was released on (DVD/Blu-ray) November 27, 2012, the second on August 6, 2013, and the third on April 15, 2014 in the United States.', 'title': 'Berserk: The Golden Age Arc'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Giofra (foaled 11 March 2008) is a British-bred, French-trained Thoroughbred racehorse and broodmare. Problems with leg injuries meant that she did not race until the autumn on her three year-old season but she then won two of her three races in late 2011 including the Listed Prix Casimir Delamarre. In 2012 she emerged as a top-class racemare, taking the Prix d'Harcourt on her seasonal debut and recording her biggest win in the Group One Falmouth Stakes at Newmarket Racecourse in July. She also finished second in the Prix Ganay and the Hong Kong Cup and third in the Prix de l'Opera. She failed to win as a five-year-old in 2013 but finished third in both the Dubai Duty Free and the Falmouth Stakes before being retired from racing.", 'title': 'Giofra'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Camille Delamarre is a French film editor and director, best known for directing "The Transporter Refueled" and "Brick Mansions". He edited films including "Transporter 3" and "Taken 2 ", among others.', 'title': 'Camille Delamarre'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Jimaní is the capital and the second largest city of the Independencia Province of the Dominican Republic. It serves as one of the two main thoroughfares to Haiti (with Dajabón), with a duty-free open-air marketplace operating on the border with Haiti. The town suffered damages in the flash flood of May 25, 2004, which killed many citizens during the night and washed away hundreds of homes.', 'title': 'Jimaní'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Canton Road is a major road in Hong Kong, linking the former west reclamation shore in Tsim Sha Tsui, Jordan, Yau Ma Tei and Mong Kok on the Kowloon Peninsula. The road runs mostly parallel and west to Nathan Road. It starts from the junction with Salisbury Road in the south and ends in the north at the junction with Lai Chi Kok Road in the Prince Edward area. The southern part Canton Road is home to many upscale retail shops, shopping centres and others business establishments, with busy traffic from both vehicles and pedestrians from morning till late night.', 'title': 'Canton Road'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Billings Metropolitan Transit (MET) is the public transit system in Billings, Montana. MET Transit provides fixed-route and paratransit bus service to the City of Billings. The MET is the primary mode of transportation for many citizens of the city. Met serves about 3,000 passengers a day. It currently employs around 200 people. All of MET's buses are accessible by citizens who use wheelchairs and other mobility devices; the buses are wheelchair lift-equipped and accessible to all citizens that are unable to use the stairs. All MET buses are equipped with bike racks for its bike riding passengers.", 'title': 'Billings Metropolitan Transit'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Hong Kong, officially the Hong Kong Special Administrative Region of the People's Republic of China, is an autonomous territory south to Mainland China and east to Macao in East Asia. With around 7.2 million Hong Kongers of various nationalities in a territory of 1,104 km, Hong Kong is the world's fourth most densely populated country or territory.", 'title': 'Hong Kong'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Zacharovce is a village and municipality in the Rimavská Sobota District of the Banská Bystrica Region of southern Slovakia. Located in the near of the main road I/50, connecting Zvolen and Košice the village is now more a living neighbourhood of Rimavská Sobota, where many citizens go for a work. The most important sightseeing is a gothic church from 15th century, later rebuilt.', 'title': 'Zacharovce'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Ahiara is a city in Mbaise, Imo State, Nigeria. The city stands about 16 miles between Owere and Umuahia. It was the location of Chukwuemeka Odumegwu Ojukwu's Ahiara Declaration during the Nigerian Civil War. It is the location of the Catholic diocese in Mbaise. The first recorded Ahiara contact with the Europeans was around 1905 when the British Aro expedition got mixed up in inter-village war which eventually had Dr. Steward a victim, as a consequence the Ahiara people were severely punished by the British forces with an invasion which forced many citizens to flee and never return.", 'title': 'Ahiara'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Although the tanks have long vanished, the city of Bombay (now Mumbai) once had many water tanks within its city limits. They were once the only source of water to the city. The only testimony to their existence is the names of the roads in their vicinity, which befuddles many citizens as to the original location to these mystifying relics of the past.', 'title': 'Tanks of Bombay'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Washington is a ghost town located in Autauga County, Alabama on the north bank of the Alabama River, just west of the mouth of Autauga Creek. Washington was founded in 1817 on the site of the former Autauga Indian town of Atagi and named in honor of George Washington. On November 22, 1819, the Alabama territorial legislature chose Washington as the county seat of Autauga County, which it remained until 1830. A courthouse, hotel, jail, post office and pillory were constructed to meet the needs of the county government. The county seat was moved to Kingston in 1830 in order to be closer to the geographic center of the county. Soon after, many citizens began to leave, and Washington was deserted by 1879. The post office in Washington was operated from 1824 to 1854.', 'title': 'Washington, Alabama'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Yau Ma Tei North () is one of the 19 constituencies in the Yau Tsim Mong District of Hong Kong which was first created in 1982 and recreated in 2015.', 'title': 'Yau Ma Tei North (constituency)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Meßstetten is a town in the Zollernalbkreis district, in Baden-Württemberg, Germany. It is situated in the Swabian Jura, 24\xa0km southeast of Balingen. It is close to the Heuberg Training Area with the Lager Heuberg. The local economy mixes agriculture with services and small-scale industry. Most of Meßstetten today has a residential character with many citizens working in the highly industrial areas of Albstadt or in Balingen. Only in Tieringen is an industrial area. A Blacksmith developed to an industrial character, also a textile firm .', 'title': 'Meßstetten'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Time Lords are a fictional, ancient extraterrestrial species in the British science fiction television series "Doctor Who", of which the series\' protagonist, the Doctor, is a member. Time Lords are so named for their command of time travel technology and their non-linear perception of time. Originally they were described as a powerful and wise race from the planet Gallifrey, from which the Doctor was a renegade; details beyond this were very limited for the first decade of the series. They later became integral to many episodes and stories as their role in the fictional universe developed. For the first eight years after the series resumed in 2005, the Time Lords were said to have been destroyed at some point between the original series\' cancellation in 1989 and the show\'s revival during the fictional Last Great Time War. In 2013, the 50th anniversary special "The Day of the Doctor" concerned this supposed destruction and their eventual survival.', 'title': 'Time Lord'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Gus Birney is an American actress, best known for her role as Alex in "The Mist".', 'title': 'Gus Birney'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Claudia Lee Black (born 11 October 1972) is an Australian actress and voice actress, known for her portrayals of Aeryn Sun in the science fiction series "Farscape" and Vala Mal Doran in the science fiction series "Stargate SG-1", as well as Sharon "Shazza" Montgomery in the film "Pitch Black". She has also had several prominent roles in video games, such as Chloe Frazer in the "Uncharted" series, the witch Morrigan in "" and "", Daro\'Xen in "Mass Effect 2" and "Mass Effect 3", and squadmate Samantha Byrne in "Gears of War 3". She also starred as Doctor Sabine Lommers in the miniseries "Containment".', 'title': 'Claudia Black'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The science fiction series, "Red Dwarf", starts some time in the future, but after an accident the protagonist is trapped in stasis for 3 million years. As with many science fiction series, the programme has a few concepts specific to its own fictional universe.', 'title': 'List of Red Dwarf concepts'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Tanith Lee (19 September 1947 – 24 May 2015) was a British writer of science fiction, horror, and fantasy. She was the author of over 90 novels and 300 short stories, a children\'s picture book ("Animal Castle"), and many poems. She also wrote two episodes of the BBC science fiction series "Blake\'s 7". She was the first woman to win the British Fantasy Award best novel award (also known as the August Derleth Award), for her book "Death\'s Master" (1980).', 'title': 'Tanith Lee'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The Mist is an American science fiction-horror thriller television series developed by Christian Torpe for Spike. It is based on the horror novella of the same name by author Stephen King. The first season, consisting of ten episodes, premiered on June 22, 2017. On September 27, 2017, Spike cancelled the series after one season.', 'title': 'The Mist (TV series)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Mists of Dawn is a juvenile science fiction novel by science fiction writer and anthropologist Chad Oliver first published in 1952 by John C. Winston, Co. as a part of the Winston Science Fiction series of juvenile novels. The story follows the adventures of adolescent Mark Nye when he is accidentally transported to the stone age by his uncle's time machine. It includes a factual foreword on the science of anthropology and how Oliver uses this science in the telling of his story.", 'title': 'Mists of Dawn'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Viagens Interplanetarias series is a sequence of science fiction stories by L.\xa0Sprague de Camp, begun in the late 1940s and written under the influence of contemporary space opera and sword and planet stories, particularly Edgar Rice Burroughs\'s Martian novels. Set in the future in the 21st and 22nd centuries, the series is named for the quasi-public Terran agency portrayed as monopolizing interstellar travel, the Brazilian-dominated "Viagens Interplanetarias" ("Interplanetary Voyages" or "Interplanetary Tours" in Portuguese). It is also known as the "Krishna" series, as the majority of the stories belong to a sequence set on a fictional planet of that name. While de Camp started out as a science fiction writer and his early reputation was based on his short stories in the genre, the "Viagens" tales represent his only extended science fiction series.', 'title': 'Viagens Interplanetarias'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Lester del Rey (June 2, 1915\xa0– May 10, 1993) was an American science fiction author and editor. He was the author of many books in the juvenile Winston Science Fiction series, and the editor at Del Rey Books, the fantasy and science fiction imprint of Ballantine Books, along with his fourth wife Judy-Lynn del Rey.', 'title': 'Lester del Rey'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Aarne Haapakoski (1904 in Pieksämäki, Southern Savonia – 1961 in Málaga) was a Finnish pulp writer. He is perhaps best known for a detective fiction series about architect/detective "Klaus Karma" and a science fiction series about a robot named "Atorox." The Atorox stories were written under the pseudonym Outsider. The Atorox Award for Finnish science fiction is named for Atorox.', 'title': 'Aarne Haapakoski'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Carol Atemi Oyungu is a Kenyan singer, songwriter and entertainer. She made her first mark up by being in girl band Intu until 2007 when they each decided to go solo. In 2003, she joined Eric Wainaina, as an assistant vocal harmony provider for his band. Oyungu released her first single "Happy" in 2004 and her debut album "Hatimaye" in 2008, and her second studio album "Manzili" in 2013.', 'title': 'Atemi Oyungu'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Maxi, Dick and Twink were an all-girl singing trio in Ireland in the late 1960s and early 1970s. Maxi is Irene McCoubrey (born 23 February 1950), Dick is Barbara Dixon (born 4 April 1952) and Twink is Adele King (born 4 April 1951).', 'title': 'Maxi, Dick and Twink'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Adèle King (born Adèle Condron-King, 4 April 1951) is an Irish entertainer better known as Twink from her time as a member of a group called Maxi, Dick and Twink which was a girl band in Ireland in the late 1960s and 1970s. She is the mother of singer Chloë Agnew from the group Celtic Woman.', 'title': 'Adele King'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Chloë Alexandra Adele Emily Agnew (born 9 June 1989 in Dublin, Ireland) is an Irish singer and songwriter who is an original former member of the Celtic music group Celtic Woman, as well as its youngest member. She comes from Knocklyon, County Dublin where she lived with her mother Adele "Twink" King and younger sister, Naomi. She sings in English, Irish, Latin, Italian, and German. Agnew has a soprano vocal range.', 'title': 'Chloë Agnew'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Maxi (born 23 February 1950) is an Irish radio disc-jockey and producer; actress, journalist and singer. She came to fame in Ireland as part of the popular girl group, Maxi, Dick and Twink, in the late 1960s.', 'title': 'Maxi (singer)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Rebecca E. Chamberlain is a visual artist and vocalist in the New York art band Maxi Geil! & Playcolt. She has exhibited her work in New York City, Boston, Los Angeles, Philadelphia, Jersey City, Amsterdam and Bologna, Italy, and been reviewed in the "New York Times, Artforum, Art in America, Tema Celeste" and "Flash Art." She is currently represented by DODGEgallery in New York.', 'title': 'Rebecca Chamberlain'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'John Joseph Linehan, MBE (born 1952, Belfast, Northern Ireland) is a Northern Irish entertainer, most known for his drag queen character May McFettridge. Linehan has, in character, been a long-running feature on local radio and television, as well as a regular pantomime dame.', 'title': 'John Linehan (entertainer)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Richie Kavanagh (born 19 March 1949) is an Irish entertainer who writes and performs his own songs. Famous for the song "Aon Focal Eile", he now has a number of hits to his name. Richie was born and raised in the Raheenwood area of Fenagh, Muine Bheag, County Carlow in Ireland where he still currently resides. Despite Psoriasis crippling Richie’s hands at the age of 44, he went on to harness his talents as a singer/songwriter and burst onto the national entertainment scene with the song Aon Focal Eile. Tony Keogh in Southeast Radio was the first man to play the CD and when Gerry Ryan began playing it on his morning show, the song became a runaway hit.', 'title': 'Richie Kavanagh'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'TBC (styled as tbc), are a Christian girl band who were launched by Innervation Trust in 2004, as a "flagship" girl band alongside their brother band Thebandwithnoname. Innervation Trust is a Christian charity that exists to recruit and resource schools teams, dubbed "Collectives", each dedicated to a major city in the UK. Innervation Trust is the product of Mark Pennells and Zarc Porter, a songwriter/producer partnership also credited with writing most of the music for, and co-founding, the World Wide Message Tribe. After 7 years of promoting the Collective bands throughout every region of the UK, they were replaced by the primary school project, Pop Connection. This has since been replaced by iSingPOP. iSingPOP works in primary schools and will spend a week teaching all the children a number of songs (usually 7) as a choir and the next week will perform these songs in their local church or activity hall/centre with an audience. They also have a recording day to make their very own album.', 'title': 'TBC (band)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Guy Richards Smit (born 1970) is an American performance artist, painter, and singer-songwriter in the band Maxi Geil! & PlayColt. He has shown at the Museum of Modern Art in New York, and in London, Los Angeles, Madrid, Valencia, Paris, Dublin, and Havana, among other places. He is represented by Charlie James Gallery in Los Angeles.', 'title': 'Guy Richards Smit'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Lancia Rally ("Tipo 151", also known as the Lancia Rally 037, Lancia 037 or Lancia-Abarth #037 from its Abarth project code "037") was a mid-engine sports car and rally car built by Lancia in the early 1980s to compete in the FIA Group B World Rally Championship. Driven by Markku Alén, Attilio Bettega, and Walter Röhrl, the car won Lancia the manufacturers\' world championship in the 1983 season. It was the last rear-wheel drive car to win the WRC.', 'title': 'Lancia Rally 037'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Armin Schwarz (born 16 July 1963) is a German rally driver. He competed in the World Rally Championship from 1988 to 2005, winning the 1991 Rally Catalunya and taking six other podium finishes. Outside the WRC, he won the German Rally Championship (1987–88), the European Rally Championship (1996) and the "Rally Masters" event at the Race of Champions (2000).', 'title': 'Armin Schwarz'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Antonio "Tony" Fassina (born July 26, 1945) is a former rally driver from Italy. He won the Italian Rally Championship in 1976 and 1979 driving a Lancia Stratos HF, and then again in 1981 behind the wheel of an Opel Ascona. In 1982, he drove the Ascona to victory in the European Rally Championship. He also competed with success in the Italian round of the World Rally Championship, Rallye Sanremo, scoring four top five results between 1976 and 1981, including outright victory in the 1979 event ahead of Walter Röhrl.', 'title': 'Antonio Fassina'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Lancia Delta Group A is a Group A rally car built for the Martini Lancia by Lancia to compete in the World Rally Championship. It is based upon the Lancia Delta road car and replaced the Lancia Delta S4. The car was introduced for the 1987 World Rally Championship season and dominated the World Rally Championship, scoring 46 WRC victories overall and winning the constructors' championship a record six times in a row from 1987 to 1992, in addition to drivers' championship titles for Juha Kankkunen (1987 and 1991) and Miki Biasion (1988 and 1989), making Lancia the most successful marque in the history of the WRC and the Delta the most successful car.", 'title': 'Lancia Delta Group A'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Armin Kremer (born December 4, 1968, Crivitz, East Germany) is a German rally driver who is currently competing in the 2013 World Rally Championship season in the WRC-2 class. He began rallying in the WRC at the 1995 Rally de Portugal and has entered various rallies since. He won the European Rally Championship in 2001 driving a Toyota Corolla WRC and the Asia-Pacific Rally Championship in 2003 in a Mitsubishi Lancer Evo VII.', 'title': 'Armin Kremer'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Lars-Erik Torph (January 11, 1961 – January 23, 1989) was a Swedish rally driver. He debuted in the World Rally Championship in 1980 and took his first points at his home event, the Swedish Rally, in 1984. Driving a Toyota Celica TCT, a Toyota Supra 3.0i and an Audi Coupé Quattro, he went on to finish on the podium four times. After just turning 28, Torph and his co-driver Bertil-Rune Rehnfeldt died while spectating the 1989 Monte Carlo Rally, after Lancia driver Alex Fiorio lost control of his Delta Integrale and crashed into them.', 'title': 'Lars-Erik Torph'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Janusz Kulig (October 19, 1969 in Łapanów near Kraków – February 13, 2004 in Rzezawa near Bochnia, Poland) was a Polish rally driver. He started his career behind the wheel of a Polski Fiat 126p and during his early years in rally he also drove a Toyota Corolla, a Opel Kadett, and a Renault Clio. He became one of the top drivers while driving Renault Megane Maxi. In this car he also won his first Polish Rally Championship title in 1997. After 2 seasons with Renault, he signed a contract with Marlboro Mobil 1 team. He changed his car to a Ford Escort WRC and in following years to a Ford Focus WRC. Those years were most successful for Kulig. He won another 2 Polish Championship titles and became well known in European and World rally. Kulig spent the 2002 and 2003 seasons competing in the European Rally Championship (2nd place in 2002) and occasional WRC events. In 2002 Janusz Kulig won the Rally du Valais. His biggest success in WRC was 1st place in PCWRC in Sweden 2003 but after the rally he was stripped of his glory by FIA due to illegal modifications in his Mitsubishi Lancer EVO VII (the flywheel had different streak than the one approved by FIA). For the 2004 Polish Championship Season he signed a contract to drive Fiat Punto S1600.', 'title': 'Janusz Kulig'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Achim Warmbold (born 17 July 1941) is a German former rally driver. He won the West German Rally Championship in 1971 and 1980, and scored two outright victories during the inaugural World Rally Championship season in 1973 at the Rally of Poland and Austrian Alpine Rally events.', 'title': 'Achim Warmbold'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Hermann Gassner Jr (born 29 November 1988 in Bad Reichenhall) is a German rally driver, currently competing in the Super 2000 World Rally Championship (SWRC). His father Hermann Gassner Sr is also a rally driver.', 'title': 'Hermann Gassner'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Walter Röhrl (born 7 March 1947) is a German rally and auto racing driver, with victories for Fiat, Opel, Lancia and Audi as well as Porsche, Ford and BMW.', 'title': 'Walter Röhrl'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Siân Gibson (born Siân Foulkes; 15 July 1976) is a Welsh actress and writer perhaps best known for her collaborations with Peter Kay, including starring in and co-writing the comedy series "Peter Kay\'s Car Share", for which she won the 2016 BAFTA TV Award for Best Scripted Comedy and the National Television Award for Best Comedy.', 'title': 'Sian Gibson'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'UhaulCarShare (formerly "UCarShare") is a for-profit carsharing service offered by U-Haul in nearly 40 cities in the United States. Those with a Uhaul Car Share membership may have use of a car, billable by the hour or by the day. However, use is generally limited to three days at a time. Most often, Uhaul Car Share vehicles are operated in communities with colleges and/or universities nearby. "The goal of [Uhaul] Car Share is to give people an alternative to owning second and third cars, and to increase the use of public transit."', 'title': 'Uhaul Car Share'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Murder on the Blackpool Express is a 2017 comedy drama television film created by Jason Cook. Starring Johnny Vegas, Sian Gibson, Nigel Havers, Una Stubbs, Griff Rhys Jones, Nina Wadia, Sheila Reid and Kevin Eldon.', 'title': 'Murder on the Blackpool Express'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Cradle to Grave is a 2015 British sitcom set around the life of Danny Baker. According to a social media message posted by outgoing BBC Director of Television, Danny Cohen, the show (which ended in October 2015) has since been commissioned for a second series. It will premiere on 11 December 2017.', 'title': 'Cradle to Grave'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Famous is an upcoming American sitcom television series created by Ralph Farquhar and Ty Hodges. Fox gave the comedy series, set around couples therapy, a 10-episode straight-to-series order in April 2016, with the series originally set to start on June 12, 2016. After difficulties during casting, the series has been put off-schedule and put into re-development.', 'title': 'Famous (TV series)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Peter Kay's Car Share is a British sitcom set around supermarket assistant manager John Redmond (Peter Kay) and promotions rep Kayleigh Kitson (Sian Gibson), and their participation in a company car share scheme.", 'title': "Peter Kay's Car Share"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Trollied is a British sitcom about employees in a fictional supermarket named "Valco", which debuted on Sky 1 on 4 August 2011. The series was filmed in a purpose-built replica supermarket in the Bottle Yard Studios in Bristol throughout April and May 2011 for the first series with the second series being filmed in June and July 2012.', 'title': 'Trollied'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Salt Lake City Intermodal Hub (also known as Salt Lake Central on Utah Transit Authority [UTA] routes and SLC by Amtrak) is a multi-modal transportation hub in Salt Lake City, Utah, United States served by the Blue Line of UTA\'s TRAX light rail system that operates in Salt Lake County and by the "FrontRunner", UTA\'s commuter rail train that operates along the Wasatch Front with service from Pleasant View in northern Weber County through Ogden, Davis County, Salt Lake City, and Salt Lake County to Provo in central Utah County. Service at the intermodal hub is also provided by Amtrak (with the "California Zephyr"), Greyhound Lines, and U Car Share, as well as UTA local bus service.', 'title': 'Salt Lake City Intermodal Hub'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Vélo\'v is a bicycle sharing system run by the city of Lyon, France, in conjunction with the advertising company JCDecaux. It has been the pioneer smart bicycle sharing system, previous systems being more ad hoc and run similar to a charity. The relationship with JCDecaux allows the city to provide the service on a cost neutral basis for the city, and at very low cost to users, in return for providing exclusive advertising access on bus shelters and the like. The primary aim is to reduce vehicle traffic within the city. The scheme also aims to reduce pollution, create a convivial atmosphere within the city, and encourage the health benefits of increased activity. Its name is a portmanteau of French "vélo" ("bike") and English "love". The first bicycle sharing system to open in France, after the pioneering 1974 scheme in La Rochelle, its thundering success inspired similar systems in major French and European cities, including Paris\' Velib\' in 2007. With the success of these two high profile smart bicycle sharing systems a new paradigm of government supporting bike sharing as a part of a public transportation network emerged. It is still the bike share scheme with the second highest market penetration (1 bike per 121 residents) in the world, after the Velib\'.', 'title': "Vélo'v"}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Beyond Blunderdome" is the eleventh season premiere of the American animated sitcom "The Simpsons". It originally aired on the Fox network in the United States on September 26, 1999, and was watched in around 8.1\xa0million homes during the broadcast. In the episode, the Simpsons are given free tickets to a preview screening of Mel Gibson\'s new film, a remake of "Mr. Smith Goes to Washington". Gibson laments his current non-violent role and wants someone to give him criticism. When Homer sees Gibson talking with Marge, he gives him a brutal review, leading Gibson to believe that Homer is the only man brave enough to give suggestions. As a result, he hires him to create a better ending. However, when the ending proves to be too controversial, Gibson and Homer end up on the run from studio executives with the film.', 'title': 'Beyond Blunderdome'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'North Haven is a town in Knox County, Maine, United States, in Penobscot Bay. The town is both a year-round island community and a prominent summer colony. The population was 355 at the 2010 census. North Haven is accessed by three-times daily ferry service from Rockland, or by air taxi from Knox County Regional Airport.', 'title': 'North Haven, Maine'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Rockland is a city in Knox County, Maine, in the United States. As of the 2010 census, the city population was 7,297. It is the county seat of Knox County. The city is a popular tourist destination. It is a departure point for the Maine State Ferry Service to the islands of Penobscot Bay: Vinalhaven, North Haven and Matinicus. ', 'title': 'Rockland, Maine'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Edina is a city in Knox County, Missouri, United States, between the North and South Forks of the South Fabius River. The population was 1,176 at the 2010 census. It is the county seat of Knox County.', 'title': 'Edina, Missouri'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Fiske O\'Hara (March 11, 1878, Rockland, Maine – July 12, 1945, Hollywood, California) was an American singer and actor who was nicknamed the "Irish Tenor".', 'title': "Fiske O'Hara"}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Matinicus Isle is an island plantation in Knox County, Maine, United States. The island is located within Penobscot Bay about 20 miles east of the mainland coast and is accessible by ferry from Rockland or by air taxi from Knox County Regional Airport. The plantation is both a year-round island community and a summer colony. The population was 74 at the 2010 census.', 'title': 'Matinicus Isle, Maine'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Barbourville is a home rule-class city in Knox County, Kentucky, in the United States. The population was 3,159 at the 2010 census. It is the county seat of Knox County. The city was formally established by the state assembly in 1812. It was incorporated in 1854 and then reïncorporated in 1856.', 'title': 'Barbourville, Kentucky'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Owls Head is a town in Knox County, Maine, United States. The population was 1,580 at the 2010 census. A resort and fishing area, the community is home to the Knox County Regional Airport. It includes the village of Ash Point.', 'title': 'Owls Head, Maine'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Knox County is a county located in the state of Maine, in the United States. As of the 2010 census, the population was 39,736. Its county seat is Rockland. The county is named for American Revolutionary War general and Secretary of War Henry Knox, who lived in the county from 1795 until his death in 1806. The county was established on April 1, 1860, and is the most recent county to be created in Maine. It was carved from parts of Waldo and Lincoln counties. The Union Fair, started in 1868, began as the efforts of the North Knox Agricultural and Horticultural Society.', 'title': 'Knox County, Maine'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Galesburg is a city in Knox County, Illinois, United States. This city is forty-five miles northwest of Peoria. As of the 2010 census, the city population was 32,195. It is the county seat of Knox County.', 'title': 'Galesburg, Illinois'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Vinalhaven is a town located on the larger of the two Fox Islands in Knox County, Maine, United States. Vinalhaven is also used to refer to the Island itself. The population was 1,165 at the 2010 census. It is home to a thriving lobster fishery and hosts a summer colony. Since there is no bridge to the island, Vinalhaven is accessible from Rockland via an approximately hour-and-fifteen-minute ferry ride across West Penobscot Bay, or by air taxi from Knox County Regional Airport.', 'title': 'Vinalhaven, Maine'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Australian Economic History Review: An Asia-Pacific Journal of Economic, Business, & Social History is a peer-reviewed academic journal with social-scientific analyses, principally of Pacific-Asian economic history. It is published three times a year by Wiley-Blackwell on behalf of the Economic History Society of Australia and New Zealand. It was established in 1961 and is edited by Stephen Morgan, John Singleton, Martin Shanahan, and Lionel Frost.', 'title': 'Australian Economic History Review'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Stephen Broadberry FBA (born 8 December 1956) is professorial fellow and professor of economic history at the University of Oxford. He has been editor of the "Economic History Review" and the "European Review of Economic History". He is president of the Economic History Society and was president of the European Historical Economics Society. He was elected a fellow of the British Academy in 2016.', 'title': 'Stephen Broadberry'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Economic History Review is a peer-reviewed history journal published quarterly by Wiley-Blackwell on behalf of the Economic History Society. It was established in 1927 by Eileen Power and is edited by Phillipp Schofield, Sara Horrell, and Jaime Reis. Its first editors were E. Lipson and R. H. Tawney and other previous editors include M. M. Postan, H. J. Habbakuk, Max Hartwell (1960–68), Christopher Dyer and Jane Humphries.', 'title': 'The Economic History Review'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Leland Hamilton Jenks (April 10, 1892 - February 1, 1976) was an American economic historian, Professor of economics and sociology at Wellesley College, and Professor at Columbia University, where he taught economic history. He is known for his work on the economic history of the migration of British capital and of the American railroad in the 19th century.', 'title': 'Leland H. Jenks'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Michael W. Flinn (1917–1983) was a British economic historian. Born into a middle-class family in 1917, he was educated at William Hulme's Grammar School in Manchester, serving as an officer in the Royal Artillery during the Second World War. After the end of the war, Flinn took a history degree at the University of Manchester before spending two years as a grammar school teacher while writing a postgraduate dissertation in his spare time. In 1959, he began lecturing at the University of Edinburgh, writing an introductory school textbook for history in 1961, which was still in print at his death. He was awarded a D. Litt by Edinburgh in 1965, and two years later was appointed to a Personal Chair in Social History. After his retirement in 1978, he lectured in the United States and continental Europe, serving as president of the Economic History Society from 1980 to 1983, when he died.", 'title': 'Michael Flinn'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Eileen Edna LePoer Power (9 January 18898 August 1940) was a British economic historian and medievalist.', 'title': 'Eileen Power'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Sir William James Ashley (25 February 1860 – 23 July 1927) was an influential English economic historian. His major intellectual influence was in organizing economic history in Great Britain and introducing the ideas of the leading German economic historians, especially Gustav von Schmoller and the historical school of economic history. His chief work is "The Economic Organisation of England", still a set text on many A-level and University syllabuses.', 'title': 'William Ashley (economic historian)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'African Economic History is an annual academic journal covering research on all aspects of the economics of the African past, including its historiography, with an emphasis on sub-Saharan, colonial and post-colonial themes. It was established in 1974 as the "African Economic History Review" and obtained its current title in 1976. The journal is published by the African Studies Program of the University of Wisconsin–Madison.', 'title': 'African Economic History'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Katrina Honeyman (18 June 1950 – 23 October 2011) was a British economic historian and Professor of Social and Economic History at the University of Leeds. Much of her work focused on the role of women and children in industrialisation in Britain.', 'title': 'Katrina Honeyman'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The T. S. Ashton Prize, established with funds donated by the late Professor T. S. Ashton (1889-1968), is awarded biennially by the Economic History Society to the author of the best article accepted for publication in the "Economic History Review" in the previous two calendar years, who satisfies at least one of the following conditions at time of submission:', 'title': 'T. S. Ashton Prize'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'A Finnish Spitz (Finnish language: "Suomenpystykorva") is a breed of dog originating in Finland. The breed was originally bred to hunt all types of game from squirrels and other rodents to bears. It is a "bark pointer", indicating the position of game by barking, and drawing the game animal\'s attention to itself, allowing an easier approach for the hunter. Its original game hunting purpose was to point to game that fled into trees, such as grouse, and capercaillies, but it also serves well for hunting elk. Some individuals have even been known to go after a bear. In its native country, the breed is still mostly used as a hunting dog. The breed is friendly and in general loves children, so it is suitable for domestic life. The Finnish Spitz has been the national dog of Finland since 1979.', 'title': 'Finnish Spitz'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Tugou (土狗, pinyin: "tǔ gǒu"), literally means Native Dog in Mandarin Chinese, is the general name for several dog breeds originated from China and still abundantly exists across the country today. Tugou includes the most popular Chinese dog breed - the Chinese Field Dog (, pinyin: "zhōng huá tián yuán quǎn"), Chinese Chongqing Dog, Xiasi Dog, and several other native dog breeds distributed across China. They are roughly 45–50\xa0cm tall at the shoulder.', 'title': 'Tugou'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The German Spaniel, also known as the Deutscher Wachtelhund (German quail dog), is a breed of dog that was developed in Germany around 1890, and is used as a hunting dog. Descended from the old German breed, the Stoeberer (lit. "rummager"), which became popular with commoners following the Revolutions of 1848 in the German states, who required a versatile hunting dog. Stoeberer is now a type of hunting dog in Germany with the Wachtelhund being its sole member. The breed is not very well known outside of Germany, but was recognised by the United Kennel Club in 1996.', 'title': 'German Spaniel'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The Kanni, which means maiden, is a rare indigenous South Indian sighthound breed of dog found in the state of Tamil Nadu. The breed is used mainly for coursing game.', 'title': 'Kanni'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "South Mountain Botanical Garden () is the largest botanical garden in Chongqing. It is a major urban park of central Chongqing, and it is one of the 8 major civil projects of Chongqing Municipal. It is located on Tongluo Mountain, an anticline range in southeastern edge of central Chongqing area. Totally 1646 plant species are raised in the garden, most of which are subtropical low mountain species. Triassic and Jurassic sedimentary rocks and geological structures are distributed throughout the garden. The botanical garden is divided into many smaller gardens. Rose garden, camellia garden, plum blossom garden, orchis garden and the endangered species garden are most popular ones. The Great Golden Eagle, a gold-colored cement eagle statue of more than 50 meters tall, is set in this garden. It is one of Chongqing's landmarks, and is used as a navigation mark by some airlines flying to Chongqing Jiangbei International Airport.", 'title': 'South Mountain Botanical Garden'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "The Chinese Chongqing Dog is a rare breed of dog native to the Chongqing city of China. In its early years, it was used for hunting wild boar and rabbits, but it's now used in China to protect families and belongings. They are an ancient, natural breed said to have existed for 2,000 years since the time of the Han Dynasty in Ancient China. After the establishment of the People's Republic of China in 1949, the breed's numbers were greatly reduced, and only people in rural communities still kept it; the breed is still rare, even in China.", 'title': 'Chinese Chongqing Dog'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Pavle Delibašić (Serbian Cyrillic: , born 30 November 1978) is a Serbian footballer. He had previously played for Spartak Subotica, Bosnian FK Leotar Trebinje, FK Čukarički Stankom, Chinese Chongqing Lifan and Greek Kallithea F.C., back in Serbia with FK Zemun and with Bulgarian Minyor Pernik and FK Banat Zrenjanin.', 'title': 'Pavle Delibašić'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'He Shu (Chinese: 何蜀; born 1948 in Chongqing) is a magazine editor and historian of the Chinese Cultural Revolution. Barred from entering high school in 1964 because of his father’s ”rightism”, he ended up becoming a temporary contract laborer. In 1972, permanently employed as a worker in the Chongqing Steel Plant. In 1981, transferred to the Chongqing People’s Broadcasting Station where he became an editorial assistant in the cultural and historical programs department. In May 1989, helped launch the Chongqing magazine "Red Crag Spring and Autumn Annals" （《红岩春秋》）of which he is (in 2009) deputy editor-in-chief.', 'title': 'He Shu'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Wetterhoun (FCI No.221, translated into English as the Frisian Water Dog) is a breed of dog traditionally used as a hunting dog for hunting small mammals and waterfowl in the province of Fryslan in the Netherlands. The name of the dog comes from the West Frisian "Wetterhûn" meaning "water dog." Plural of Wetterhoun is Wetterhounen in Dutch. The breed may also be called the "Otterhoun" (not to be confused with the Otterhound) or "Dutch Spaniel", although it is not a Spaniel-type dog.', 'title': 'Wetterhoun'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Chongqing Dangdai Lifan () is a professional Chinese football club that currently participates in the Chinese Super League under licence from the Chinese Football Association (CFA). The team is based in Chongqing and their home stadium is the Chongqing Olympic Sports Center that has a seating capacity of 58,680. They are owned by Dangdai International Group.', 'title': 'Chongqing Dangdai Lifan F.C.'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Pieter Smith (born April 3, 1987 in Upington) is a South African sprinter, who specialized in the 400 metres. He set his personal best time of 45.63 seconds by winning the 400 metres event at the 2009 South African Championships in Stellenbosch.', 'title': 'Pieter Smith'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Corné du Plessis (born 20 March 1978) is a South African sprinter. Together with Morne Nagel, Lee-Roy Newton and Mathew Quinn he won a silver medal in 4 x 100 metres relay at the 2001 World Championships in Athletics. Their time of 38.47\xa0seconds was a South African record. Earlier in the season he won the bronze medal in the 200 metres at the 2001 Summer Universiade.', 'title': 'Corné du Plessis'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Oscar Leonard Carl Pistorius OIB ( ; ] ; born 22 November 1986) is a South African sprint runner and convicted murderer. Both of Pistorius' legs were amputated below the knee when he was 11 months old. He was the tenth athlete to compete at both the Paralympic Games and Olympic Games, competing in sprint events for below-knee amputees in Paralympic events, and in non-disabled sprint events.", 'title': 'Oscar Pistorius'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Justine Palframan (born 4 November 1993) is a South African sprinter specialising in the 200 and 400 metres. She won the 400 m event at the 2015 Summer Universiade. She also represented South Africa at the IAAF 2013 World Championships and 2016 Olympics.', 'title': 'Justine Palframan'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'H Pistorius & Co is a private South African company based in Pretoria, which according to its website is the oldest supplier of agricultural lime in Africa. The company is also the backbone for the personal wealth of the Pistorius family (one member being Oscar Pistorius).', 'title': 'H Pistorius &amp; Co'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Gordon Raymond Day (born 4 January 1936) is a retired South African sprinter. He competed at the 1960 Summer Olympics in the 400 metres and 4×400 metres relay events and finished fourth in the relay. He was part of the South African team that won the 4×440 yards relay at the 1958 British Empire and Commonwealth Games, while finishing third in the individual 220 yards.', 'title': 'Gordon Day'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Paul Nash (born 1947) is a South African sprinter who tied the 100-metre world record four times in 1968 with a time of 10.0 seconds. He attended Michaelhouse school in the province of KwaZulu-Natal, South Africa.', 'title': 'Paul Nash (athlete)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Tamzin Thomas (born 6 October 1997) is a South African sprinter. She won two medals at the 2015 African Junior Championships.', 'title': 'Tamzin Thomas'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Tsholofelo Thipe (née Selemela) (born 9 December 1986) is a South African sprinter, who specialized in the 400 metres. She set a personal best time of 51.15 seconds by winning the 400 metres event at the 2009 South African Championships in Stellenbosch. She was born in Rustenburg, North West Province.', 'title': 'Tsholofelo Thipe'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Ncincilili Titi (born 15 December 1993) is a South African sprinter who competes primarily in the 200 metres events. He finished fourth at the 2014 African Championships, as well as at the 2015 Summer Universiade.', 'title': 'Ncincihli Titi'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'West Tyson County Park is a county park in the U.S. state of Missouri consisting of 673 acres located in St. Louis County east of the town of Eureka. The park is located north of Interstate 44, west of Tyson Research Center, east of Route 66 State Park, and south and east of the Meramec River.', 'title': 'West Tyson County Park'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Casa Grande Hotel is a historic hotel located at the intersection of 3rd Street and historic U.S. Route 66 in downtown Elk City, Oklahoma. The hotel opened in 1928, shortly after Route 66 was designated, to lodge the growing number of travelers on the highway. Architects Hawk and Parr designed the four-story building in the Spanish Eclectic style; their design features arched windows and doors and stone ornamentation along the arches. Spanish-influenced styles such as the Spanish Eclectic were common on the southwestern portion of Route 66 due to the region's Spanish history. The luxury hotel faded in popularity after the 1920s, and as a result, the Casa Grande is the only high-rise hotel on Route 66 between Oklahoma City and Amarillo, Texas.", 'title': 'Casa Grande Hotel (Elk City, Oklahoma)'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Route 66 State Park is a state park in the U.S. state of Missouri, located on the former site of the town of Times Beach. It is a 419 acre park located less than 1 mi east of Eureka.', 'title': 'Route 66 State Park'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'U.S. Route\xa066 (US\xa066 or Route\xa066), also known as the Will Rogers Highway, the Main Street of America or the Mother Road, was one of the original highways within the U.S. Highway System. US\xa066 was established on November 11, 1926, with road signs erected the following year. The highway, which became one of the most famous roads in the United States, originally ran from Chicago, Illinois, through Missouri, Kansas, Oklahoma, Texas, New Mexico, and Arizona before ending at Santa Monica, California, covering a total of 2448 mi . It was recognized in popular culture by both the hit song "(Get Your Kicks on) Route 66" and the "Route\xa066" television show in the 1960s.', 'title': 'U.S. Route 66'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'U.S. Route\xa066 (US\xa066, Route\xa066), the historic east–west US highway between Chicago, Illinois and Santa Monica, California, passed through one brief segment in the southeastern corner of Kansas. It entered the state south of Baxter Springs and continued north until it crossed the Brush Creek, from where it turned east and left the state in Galena. After the decertification of the highway in 1985, this road segment was numbered as US-69 (alternate) from Quapaw, Oklahoma north to Riverton, Kansas and as K-66 (Kansas highway) from Riverton east to Route\xa066 in Missouri.', 'title': 'U.S. Route 66 in Kansas'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Angel Delgadillo is a businessowner in Seligman, Arizona who has been dubbed the \'guardian angel\' of U.S. Route 66. He is the main founder of the Historic Route 66 Association of Arizona, established in 1987 to campaign for "Historic Route 66" signage on the former US highway; similar initiatives have since been established in every U.S. Route 66 state.', 'title': 'Angel Delgadillo'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Route 66 Mural Park (opened 2013 in Joplin, Missouri) operates as a public park, specifically as a touchstone for US Route 66 tourists as well as for local preservers of U.S. Route 66 in Missouri. The park includes two large tile murals proposed by Paul Whitehill, produced by Images In Tile USA and designed by artists Chris Auckerman and Jon White. The park also features a bifurcated red sports car that anyone on pilgrimage can slide up beside and have a quickie photograph taken. Close to the intersection of 7th Street and Main, the mural covers the south side of Pearl Brothers, the iconic green hardware store of downtown Joplin. Near that same intersection, US Route 66 once shifted west and headed into Kansas.', 'title': 'Route 66 Park'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Dixie Travel Plaza, previously known as the Dixie Truck Stop and Dixie Trucker's Home, is a large trucker and travel plaza located in McLean, Illinois, on Interstate 55. It was established by J.P. Walters and John Geske in 1928 on old US Route 66 as a small sandwich stand in a truck mechanic's garage. By 1930, quickly growing demand had necessitated expansion into a full-size restaurant. The restaurant was expanded several times afterwards, and rebuilt once after a fire in 1965. Walters, Geske and the Dixie Trucker's Home have been recognized by the Route 66 Association of Illinois for their contributions—from 1926 to 1977—to the character of Route 66. They were inducted into the association's hall of fame on June 9, 1990. Dixie was previously home to the Route 66 Hall of Fame when it opened in 1990. In 2003, after Dixie changed ownership, the museum was moved to a new, larger location in Pontiac, Illinois.", 'title': 'Dixie Travel Plaza'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'U.S. Route\xa066 (US\xa066, Route\xa066) is a former east–west United States Numbered Highway, running from Santa Monica, California to Chicago, Illinois. In Missouri, the highway ran from downtown St. Louis at the Mississippi River to the Kansas state line west of Joplin. The highway was originally Route\xa014 from St. Louis to Joplin and Route\xa01F from Joplin to Kansas. It underwent two major realignments (in the St. Louis and Joplin areas) and several lesser realignments in the cities of St. Louis, Springfield, and Joplin. Current highways covering several miles of the former highway include Route\xa0100, Route\xa0366, Route\xa0266, Route\xa096, and Route\xa066. Interstate 44 (I-44) approximates much of US\xa066 between St. Louis and Springfield.', 'title': 'U.S. Route 66 in Missouri'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "Times Beach is a ghost town in St. Louis County, Missouri, United States, 17 mi southwest of St. Louis and 2 mi east of Eureka. Once home to more than two thousand people, the town was completely evacuated early in 1983 due to a dioxin contamination that made national headlines. It was the largest civilian exposure to dioxin in the country's history.", 'title': 'Times Beach, Missouri'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Bill Bryson's African Diary is a 2002 book by best-selling travel writer Bill Bryson. The book details a trip Bryson took to Kenya in 2002. Bryson describes his experiences there and observations about Kenyan culture, geography, and politics, as well as his visits to poverty-fighting projects run by CARE International, to which he donated all royalties for the book.", 'title': "Bill Bryson's African Diary"}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Life and Times of the Thunderbolt Kid is a 2006 memoir by best-selling travel writer Bill Bryson. The book delves into Bryson\'s past, telling of his youth growing up in Des Moines, Iowa, during the 1950s and early 1960s. It also reveals the backstory between himself and Stephen Katz, who appeared in "A Walk in the Woods" and "." Bryson also describes and comments on American life in the 1950s. The title of the book comes from an imaginary alter-ego Bryson invented for himself in his childhood, who has the ability to "vaporise people."', 'title': 'The Life and Times of the Thunderbolt Kid'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Down Under is the British title of a 2000 travelogue book about Australia written by best-selling travel writer Bill Bryson. In the United States and Canada it was published titled In a Sunburned Country, a title taken from the famous Australian poem, "My Country". It was also published as part of "Walk About", which included "Down Under" and another of Bryson\'s books, "A Walk in the Woods: Rediscovering America on the Appalachian Trail", in one volume.', 'title': 'Down Under (book)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Lost Continent: Travels in Small-Town America is a book by travel writer Bill Bryson, chronicling his 13,978 mile trip around the United States in the autumn of 1987 and spring 1988. It was Bryson's first travel book.", 'title': 'The Lost Continent: Travels in Small-Town America'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Michael G. Bryson (August 22, 1942 – May 22, 2012) was a news and sports reporter and editor from Des Moines, Iowa and the elder brother of travel writer Bill Bryson. He co-authored a book "The Babe Didn\'t Point: And Other Stories About Iowans and Sports" with his son Michael G. Bryson Jr in 1989. He also wrote a book called "The Twenty-Four-Inch Home Run" in 1990. Bryson was an editor and associate publisher of the Sun Press Newspapers in Hawaii from 1979 to 1986. He covered the New York Mets in 1969 while a sports reporter for the Associated Press. He was a news reporter for the "Des Moines Register and Tribune" from 1970 to 1979. He attended Drake University.', 'title': 'Michael Bryson'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Notes from a Big Country, or as it was released in the United States, I\'m a Stranger Here Myself, is a collection of articles written by Bill Bryson for "The Mail on Sunday"\'s "Night and Day" supplement during the 1990s, published together first in Britain in 1998 and in paperback in 1999. The book discusses Bryson\'s views on relocating to Hanover, New Hampshire, after spending two decades in Britain.', 'title': 'Notes from a Big Country'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'William Eugene "Bill" Bryson Sr. (March 3, 1915 – January 1986) was a sports journalist for the "Des Moines Register" for 50 years. He married Agnes Mary McGuire (born 1913 in Nebraska, died 2015) and had three children: Michael, William, and Mary Elizabeth. A book of some of his best sports stories was published by his son Michael called "". His son Bill Bryson is a popular journalist and writer of travel books, who now lives in England.', 'title': 'Bill Bryson Sr.'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Des Moines is the capital and the most populous city in the U.S. state of Iowa. It is also the county seat of Polk County. A small part of the city extends into Warren County. It was incorporated on September 22, 1851, as Fort Des Moines, which was shortened to "Des Moines" in 1857. It is on and named after the Des Moines River, which likely was adapted from the French colonial name, "Rivière des Moines," meaning "River of the Monks." The city\'s population was 203,433 as of the 2010 census. The five-county metropolitan area is ranked 91st in terms of population in the United States with 599,789 residents according to the 2013 estimate by the United States Census Bureau.', 'title': 'Des Moines, Iowa'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Mother Tongue (ISBN\xa0 ) is a book by Bill Bryson which compiles the history and origins of the English and the language\'s various quirks. It is subtitled "English And How It Got That Way". The book discusses the Indo-European origins of English, the growing status of English as a global language, the complex etymology of English words, the dialects of English, spelling reform, prescriptive grammar, and more minor topics including swearing. This account popularises the subject and makes it accessible to the lay reader; but Bryson\'s book has been criticised for some inaccuracies, such as the perpetuation of several urban myths, including an uncritical account of the number of words Eskimos have for snow. He also inaccurately describes some other languages and their writing systems, such as Chinese and Japanese, just to give an example.', 'title': 'The Mother Tongue'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Neither Here nor There: Travels in Europe is a 1991 humorous travelogue by American writer Bill Bryson. It documents the author\'s tour of Europe in 1990, with many flashbacks to two summer tours he made in 1972 and 1973 in his college days. Parts featuring his 1973 tour focus to a large extent on the pseudonymous "Stephen Katz", who accompanied Bryson, and who would play a more prominent role in Bryson\'s later book "A Walk in the Woods", as well as appearing in "The Life and Times of the Thunderbolt Kid".', 'title': 'Neither Here nor There: Travels in Europe'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Country Jam USA is a country music festival that celebrates music during the very heart of Summer. The outdoor music festival features the hottest headliners of today’s country music. There are many ways to attend and enjoy the festival including Sky Box to see the action behind the scenes of the artists or be in the front of the stage with tickets to the Party Pit! Reserved seating, VIP packages are available to upgrade your day of music.', 'title': 'Country Jam USA'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Wakestock Action Sports and Music Festival is a wakeboarding contest and Canada’s largest action sports and music festival . It is held in Ontario, Canada on the Toronto Islands, Toronto, Ontario. The name Wakestock refers to the famous outdoor music festival Woodstock.', 'title': 'Wakestock (Canada)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Spring Awakening was founded as a concert series in 2008. The event eventually outgrew the theater, and in 2012 SAMF was turned into a two-day outdoor music festival at Soldier Field by the Chicago-based promoting agency React Presents. In 2013, Spring Awakening Music Festival expanded to three days with over 90,000 people in attendance. SAMF has been held either the second or third weekend of June Over the years, the Festival has become increasingly popular due to the large fan base of electronic dance music in the Chicago area. As people now come from across the globe just to attend the Festival, there are discussed rumors that the Festival could be extending onwards towards many other states.', 'title': 'Spring Awakening (festival)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Intro Music Festival is an annual outdoor electronic music festival that occurs in late May in the city of Beijing, China. It is one of the largest outdoor music festival held in China.', 'title': 'Intro Music Festival'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Global Gathering was an annual dance music festival by Angel Festivals Limited. Festivals are held in countries such as the UK, Poland, Russia, Belarus, Ukraine and feature leading electronic music artists from around the globe. The festival has been running since 2001; the concept came about following enormous interest in the opening "Code" club (now "Air"), the home of Godskitchen. The organisers recognised that there was room to expand dance music from clubs to outdoor music festival venues.', 'title': 'Global Gathering'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "The Ravinia Festival is the oldest outdoor music festival in the United States, with a series of outdoor concerts and performances held every summer from June to September. In Ravinia Park's first summer of 1905, it hosted the New York Philharmonic, and the prairie style Martin Theater dates from this time period. It has been the summer home of the Chicago Symphony Orchestra (CSO) since 1936. Located in Highland Park, Illinois, the festival operates on the grounds of the 36 acre (150,000 m²) Ravinia Park, with a variety of outdoor and indoor performing arts facilities.", 'title': 'Ravinia Festival'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Meredith Music Festival (otherwise known simply as Meredith or MMF) is a three-day outdoor music festival held every December at the "Supernatural Amphitheatre", a natural amphitheatre located on private farmland near the town of Meredith in Victoria, Australia. A self-funded, non-commercial event that was first held in 1991, the festival spawned Golden Plains, a music festival that takes place over the Labor Day long weekend in March.', 'title': 'Meredith Music Festival'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Orange Drive Miami Beach Music Festival is a three-day outdoor music festival that occurs on New Year’s weekend in South Beach, on Ocean Drive between 5th-14th streets. A state of the art amphitheater is constructed on the beach. Revelers party on the sand and under the stars in average temperatures of 70 degrees during that time period. Orange Drive is positioned to be the biggest and coolest New Year’s celebration on the planet!', 'title': 'Orange Drive Miami Beach Music Festival'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'James Conlon (born March 18, 1950) is an American conductor of opera, and symphonic and choral works. He is Music Director of Los Angeles Opera and Principal Conductor of the Italian RAI National Symphony Orchestra. He was the long serving director of the two-week Cincinnati May Festival from 1979 through 2016. From 2005 to 2015, he was music director at the Ravinia Festival, the summer home of the Chicago Symphony Orchestra. He is known for his efforts in reviving music by composers suppressed during the Nazi regime.', 'title': 'James Conlon'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Maitreya Festival (sometimes spelt Maitreyah festival) is a large outdoor music festival held yearly in Melbourne, Australia. The festival generally plays a mixture of Psy-trance and techno, and has a large associated Alternative community. It has grown considerably in size over its 10-year history, with the event starting with 2000 people, building to attract 10,000 attendees in 2015, its 9th year of operation. In terms of outdoor electronic music events (commonly known as Doofs or Bush Doofs in Australia, this makes it the third biggest after Rainbow Serpent and Earthcore. It is the largest Psytrance event in Australia. Maitraya has been said as some to be more “Ideaologically in tune” and less commercial.', 'title': 'Maitreya Festival'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Human Romance is the seventh studio album by the American melodic death metal band Darkest Hour. The album was released on February 22, 2011, in North America through eOne Music, and was released on March 7 in Europe through Century Media Records. This would be Darkest Hour's last album with drummer Ryan Parrish and bassist Paul Burnette.", 'title': 'The Human Romance'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Battle of Hürtgen Forest (German: "Schlacht im Hürtgenwald" ) was a series of fierce battles fought from 19 September to 16 December 1944 between American and German forces on the Western Front during World War II in the Hürtgen Forest about 50 mi2 east of the Belgian–German border. It was the longest battle on German ground during World War II, and is the longest single battle the U.S. Army has ever fought.', 'title': 'Battle of Hürtgen Forest'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Deliver Us is the fifth studio album by American melodic death metal band Darkest Hour. It was released on July 10, 2007 through Victory Records. The album debuted at number 110 on the Billboard album charts, with sales of 6,600. "Sanctuary" is featured in the video game, "Tony Hawk\'s Proving Ground", while "Demon(s)" is featured in "Guitar Hero 5" and "Doomsayer" was made available in "" through the "Darkest Hour Track Pack", the last to be released by Activision. The artwork was created by John Baizley who has also done art for bands such as Pig Destroyer, Daughters, and his own band Baroness.', 'title': 'Deliver Us (Darkest Hour album)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Darkest Hour is a phrase coined by British prime minister Winston Churchill to describe the period of World War II between the fall of France in 1940 and the Nazi invasion of the Soviet Union in 1941, when the British Empire stood alone against Nazi Germany and the Axis Powers in Europe. The length of time between the fall of France in June 1940 and the German invasion of the Soviet Union in June 1941 measured 363 days, or 11 months and 28 days. It is particularly used for the time when the United Kingdom was under direct threat of invasion; following the evacuation of the British Army from Dunkirk and prior to victory in the Battle of Britain. The darkest moment is usually considered to have been 10 May 1941, when over 1,500 civilians died in Luftwaffe bombing raids on London alone.', 'title': 'The Darkest Hour'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Leonard G. “Bud” Lomell (January 22, 1920 – March 1, 2011) was a highly decorated former United States Army Ranger who served in World War II. He is best known for his actions in the first hours of D-Day at Pointe du Hoc on the coast of Normandy, France. Pointe du Hoc was the site of the German Army’s largest coastal weapons, five 155-millimeter German guns with a 25-kilometer range that endangered the tens of thousands of troops landing on Omaha Beach and Utah Beach, and thousands of watercraft in the English Channel supporting the Normandy invasion. Unbeknownst to the Allied intelligence, the Germans had concealed the guns in an orchard, but left them operational and ready to fire. Through skill, courage and “pure luck,” Lomell found and quickly disabled all five guns. Lomell was recognized by historian Stephen Ambrose as the single individual — other than Gen. Dwight D. Eisenhower — most responsible for the success of D-Day. Six months later, in the Battle of Hürtgen Forest, he would again distinguish himself, earning a Silver Star for his heroism and leadership as the 2nd Ranger Battalion captured and held Hill 400. After the war he returned to Ocean County, New Jersey, becoming an attorney in Toms River.', 'title': 'Leonard Lomell'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "John Wilson Minick (June 14, 1908 – November 21, 1944), born in Wall, Pennsylvania, near East McKeesport in Allegheny County, to Anthony Fuhrman and Alma J. (Churchfield) Minick, whose patriarchal Pennsylvania Dutch ancestry can be traced back to the 1700s in Perry County, Pennsylvania. He was a United States Army soldier and a recipient of the United States military's highest decoration—the Medal of Honor—for his actions during the Battle of Hürtgen Forest in World War II.", 'title': 'John W. Minick'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Hürtgenwald is a municipality in the district of Düren in the federal state of North Rhine-Westphalia, Germany. It is located in the Eifel hills, approx. 15\xa0km south-west of Düren. Much of the area is covered by forest (Hürtgenwald in literal translation means Hürtgen Forest).', 'title': 'Hürtgenwald'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Darkest Hour: Europe \'44-\'45 is a free modification developed by Darklight Games / The Darkest Hour Team for Tripwire Interactive\'s multiplayer first-person shooter video game "", It is based on the Western Front during World War II between 1944 and 1945, depicting the conflict between Allied and German forces. Several large-scale operations are covered, including the invasion of Normandy, Battle of the Bulge, Operation Market Garden, and Battle of the Hürtgen Forest.', 'title': "Darkest Hour: Europe '44-'45"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Battle of Heartbreak Crossroads was fought at a vital crossroads near a forester\'s cabin named Wahlerscheid, astride the Siegfried Line ("Westwall") that ran along the Höfen-Alzen and Dreiborn ridges, about 5.6 mi north of Krinkelt-Rocherath, Belgium. In early December 1944, the U.S. V Corps trucked the experienced 2nd Infantry Division from positions it had held in the south to Krinkelt-Rocherath, twin villages adjacent to Elsenborn Ridge and near the southern tip of the Hürtgen Forest.', 'title': 'Battle of Heartbreak Crossroads'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'When Trumpets Fade, an HBO war film first presented on June 27, 1998, was directed by John Irvin, produced by John Kemeny and written by W.W. Vought. It is set during the World War II Battle of Hürtgen Forest in Autumn of 1944.', 'title': 'When Trumpets Fade'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'A beer shop (also referred to as beershop) is a retail store where beer and other goods related to beer are sold. Beer shops can be found all around the world, but there are many located in famous beer countries like Belgium, Germany or England. Beer shops range in size, and may be located on streets or in shopping malls. Beer shops usually offer many different kinds of beer brands. Some shops offer only regional beer brands which are famous or well known in their region. Others also offer a big range of beer including beer brand from all around the world.', 'title': 'Beer shop'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Emu is a beer brand name now owned by Lion. It was originally brewed by the Emu Brewery in 1908 until the brewery's sale to the Swan Brewery in 1927. The production of the Emu branded beer continued from a separate autonomous brewery in Perth until 1978, and then was relocated to a combined brewery in Canning Vale. In 2014 Lion Nathan moved production of both the Emu and Swan beer brands to the company's West End Brewery in South Australia.", 'title': 'Emu (beer)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Christian Moerlein Brewing Co. is a private beer company that began production in 1853 in Cincinnati, Ohio by German immigrant Christian Moerlein. Before closing its doors in 1919 as result of prohibition, Christian Moerlein was among the ten largest American breweries by volume. In 1981, the brand was revived by the Hudepohl Brewing Company as a "better beer" a precursor to the current craft beer category and is considered a pioneer craft beer of today\'s craft beer movement. In 1999, Hudepohl-Schoenling Brewing Co. sold out to a group of out-of-town owners, a sale that included the famed Christian Moerlein craft beer brand. In 2004, Greg Hardman a Cincinnati resident purchased Christian Moerlein, as well as 65 other historic Cincinnati brands, returning local ownership to Cincinnati in a move that included a plan to return Cincinnati\'s grand brewing traditions. The four phase plan was, 1) return the local ownership of Cincinnati\'s great beer brands to Cincinnati; 2) build their base of sales to; 3) open local brewing operations in the heart of Cincinnati\'s historic Brewery District and; 4) open a World-class Moerlein Lager House on the banks of the Ohio River to act as a signal that beer is back in Cincinnati.', 'title': 'Christian Moerlein Brewing Co.'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Ice beer is a marketing term for pale lager beer brands which have undergone some degree of fractional freezing somewhat similar to the German Eisbock production method. These brands generally have higher alcohol content than typical beer and generally have a low price relative to their alcohol content.', 'title': 'Ice beer'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Karlovačko is a popular beer in Croatia and Bosnia-Herzegovina. It is the signature product of brewer Karlovačka Pivovara, located in the city of Karlovac. It has an alcohol content of about 5.4 percent by volume. Its makers describe it as "golden-yellow" in color and "refreshingly" bitter in taste. It won a 2005 Brewing Industry International Award golden medal in the category of beers with 4.5 to 5.5 percent alcohol. Pictured here in a brown bottle, Karlovačko is now sold in green bottles (also in cans and plastic packaging). A new era of the brewery business, then called the Karlovačka pivovara, began on 1 April 2003. That was when HEINEKEN, the most international brewer, became the owner of the brewery. As a successful and significant part of the HEINEKEN company, Karlovačka pivovara took the name Heineken Hrvatska d.o.o. on 10 December 2014. In its portfolio Heineken Hrvatska has top-level products that will satisfy the tastes of adult beer lovers on various occasions. Besides Karlovačko beer, the family of beer also includes: Karlovačko 0.0% Maxx, Karlovačko Limun Natur Radler, Karlovačko Laganini Natur Radler, Karlovačko Leđero Natur Radler, Karlovačko nepasterizirano Retro and Karlovačko crno. They also have international brands such as Heineken, Amstel Premium Pilsener, Edelweiss Snowfresh, Desperados, Affligem, cider No 1 in the world - Strongbow and Stari lisac, local cider. In their portfolio there are also Laško Zlatorog, Laško Special beers in three flavors and Union Radler grapefruit.', 'title': 'Karlovačko'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Vífilfell is the Icelandic franchisee for brands of The Coca-Cola Company. Those brands include Coca-Cola, Sprite, Fanta, Fresca, Powerade, Magic and Burn. Vífilfell also produces some beer brands along with local fruit juices and a chocolate milk drink Kappi.', 'title': 'Vífilfell'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Birra Tirana "(English: Tirana Beer )" is a beer company based in Tirana, Albania. It is the largest beer producer and the largest selling beer in the country. It is also exported and sold in Kosovo and the United States. The company is fabricated by Birra Malto Brewery. It currently produces three different beer brands. Birra Tirana is sold both in bottles and cans of 0.33 lit and 0.5 lit and also in kegs 30 liters and 50 liters.', 'title': 'Birra Tirana'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Leonardus (Leo) Petrus Beukeboom (1943) is a signpainter and lettering artist from De Pijp, Amsterdam perhaps best known for his krulletters ("curly letters") that adorn the city\'s bruin cafes ("brown cafes") throughout the central neighborhoods of the Jordaan, de Pijp, and Nieuwe Zijde. Beukeboom was originally trained as a typographic compositor, holding both a diploma and certificate in layout from the Amsterdamse Grafische School. After completing his courses in 1962, Beukeboom worked trivial jobs until 1967 when he began working as a freelance signpainter, almost exclusively for the Amsterdam-based Heineken brewery which commissioned him to decorate cafes as a general advertising strategy, a collaboration that lasted until 1989. Beukeboom devoted over thirty years decorating cafes in the krulletters tradition, until 2001 when forced to retire due to health reasons.', 'title': 'Leo Beukeboom'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Heineken International is a group which owns a worldwide portfolio of over 170 beer brands, mainly pale lager, though some other beer styles are produced. As of 2006, Heineken owns over 125 breweries in more than 70 countries and employs approximately 57,557 people.', 'title': 'Heineken brands'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Anheuser-Busch InBev SA/NV (] ; abbreviated as AB InBev) is the largest beer company in the world. It had 200 brands prior to the merger with SABMiller on October 10, 2016. The combined ABInBev/SAB Miller entity has approximately 400 beer brands as of January 2017.', 'title': 'AB InBev brands'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Dąbrowski (] ; feminine Dąbrowska, plural Dąbrowscy) or Dabrowski is the 11th most common surname in Poland (87,304 people in 2009); this is down from an apparent rank of 4th in 1990. "Dąbrowski" is a habitational name derived from the placename \'Dąbrowa\' or \'Dąbrówka\', which is used for several specific places in Poland or generically as "oak grove", the English meaning for these Polish words. Variants of the surname include Dombrowski, Dobrowski, and Dobrosky. "Dobrowski" also has an independent origin as a habitational name derived from the placename \'Dobrów\'. The text-figure below summarizes the relationships among these various words. In other Slavic countries, the same surname takes the form Dubrovsky, as the Polish "ą" corresponds to "u" in most other Slavic languages.', 'title': 'Dąbrowski'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Del Rosario, in Spanish and Italian languages, and do Rosário in Portuguese language (English: of the rosary ) is a surname that has as its etymology, the Latin preposition, ""de"" meaning ""of the"" and the Latin noun ""rosarium"", meaning ""rosegarden"" or ""garland of roses"" but in this case, takes the meaning of ""rosary"", the Roman Catholic devotion to the Virgin Mary. In fact, its origins are from the Middle Ages, around the 12th century, and it is much associated with the cult of the Virgin Mary at the time when the rose became part of the holy aura, which surrounded anything to do with Mary, and the Our Lady of the Rosary\'s Feast of the Holy Rosary. This surname is common in Romance languages regions, and is also one of the most common surnames in the Philippines and other islands of Spanish East Indies since the mid-19th century, and where it is one of the most popular clans together with Cruz, Santos, Reyes, Gonzales, Bautista, García, Mendoza, Aquino, and others, because there are so many people that have this surname.', 'title': 'Del Rosario'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Back from the Grave, Volume 4 (CD), is the fourth installment in the Back from the Grave compact disc-exclusive series of garage rock compilations assembled by Tim Warren of Crypt Records. It was released on October 10, 2000. Its track listing differs from that of the LP version, which is part of the "Back From the Grave" LP-edition series, also on Crypt. In keeping with all of the entries in the series, and as indicated in the subheading which reads "Raw \'n\' Crude Mid-60s Garage Punk! ," this collection consists of many songs which display the rawer and more aggressive side of the genre and are often characterized by the use of fuzztone-distorted guitars and rough vocals. Accordingly, the set generally excludes psychedelic, folk rock, and pop-influenced material in favor of basic primitive rock and roll. The packaging features a booklet containing well-researched liner notes written by Tim Warren which conveys basic information about each song and group, such as origin, recording date, and biographical sketches, usually written in a conversational style that includes occasional slang, anecdotes, humorous asides. The liner notes are noticeably opinionated, sometimes engaging in tongue-in-cheek insults directed at other genres of music. The booklet also includes photographs of the bands, and the front cover features a highly satirical cartoon by Mort Todd depicting revivified "rock and roll" zombies who, on this occasion, with the help of Batman\'s sidekick, Robin, have taken the 1966 TV series Batmobile out for a "wild joyride" and are intent on causing as much mayhem as possible and "lassoing" unsuspecting bystanders—only on this outing, their "victims" are more "randomly selected" than as customarily portrayed on "Back from the Grave" sleeves.', 'title': 'Back from the Grave, Volume 4 (CD)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The Frisian languages are a closely related group of Germanic languages, spoken by about 500,000 Frisian people, who live on the southern fringes of the North Sea in the Netherlands and Germany. The Frisian languages are the closest living language group to the Anglic languages; the two groups make up the Anglo-Frisian languages group. However, modern English and Frisian are not mutually intelligible, nor are Frisian languages intelligible among themselves, due to independent linguistic innovations and foreign influences.', 'title': 'Frisian languages'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Mandel is a surname that occurs in multiple cultures and languages. It is a Dutch, German and Jewish surname, meaning "almond", from the Middle High German and Middle Dutch "mandel". Mandel can be a locational surname, from places called Mandel, such as Mandel, Germany. Mandel may also be a Dutch surname, from the Middle Dutch "mandele", meaning a number of sheaves of harvested wheat. The name may refer to:', 'title': 'Mandel'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Pogrebinsky (also spelled "Pogrebinski", "Pogrebinskii", and "Pogrebinskiy") is a surname of Slavic language origin. The earliest record of "Pogrebinsky" comes from Ukraine. The surname may derive from a place of origin or refer to someone who worked at a graveyard or was involved in burials. In Slavic languages, the prefix "po" indicates "by" or "near" while "grob" may refer to a grave, casket, or cellar.', 'title': 'Pogrebinsky'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'DOI is a Hindu Gurjar surname and also a Japanese surname Doi (土井、土居、土肥 ) are three Japanese family names that are pronounced identically, with the first kanji of each pair of characters meaning "earth." Since they are the same phonetically, they are romanized identically: "do" for the first character and "i" for the second. Their identical pronunciation makes them function as the same surname in languages with writing systems that do not use some form of Chinese characters (for example, the Latin alphabet).', 'title': 'Doi (surname)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Santamaria (also spelled Santamaría or Santa Maria) is a surname from the Latin Arch in Europe. The name, a reference to the Blessed Virgin Mary meaning "Holy Mary" or "Saint Mary", means the same thing in the Spanish, Italian, Portuguese and Catalan languages, as thus it has origins in several different European countries where those languages are spoken. The surname has spread further afield to the Americas, especially South America and various other places via immigration and colonisation.', 'title': 'Santamaria'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Gref is a German surname of Frisian origin, meaning "Grave". It may refer to', 'title': 'Gref'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Graham ( ) is a masculine given name in the English language. According to some sources, it comes from an Old English word meaning "grey home". According to other sources, it comes from the surname "Graham", which in turn is an Anglo-French form of the name of the town of Grantham, in Lincolnshire, England. The settlement is recorded in the 11th century "Domesday Book" variously as "Grantham", "Grandham", "Granham" and "Graham". This place name is thought to be derived from the Old English elements "grand", possibly meaning "gravel", and "ham", meaning "hamlet" the English word given to small settlements of smaller size than villages. In the 12th century the surname was taken from England to Scotland by Sir William de Graham, who founded Clan Graham. Variant spellings of the forename are "Grahame" and "Graeme". The forename "Graham" is considered to be an English and Scottish given name. Its origin as a surname has led to its occasional use as a female given name, as for example in the case of Graham Cockburn, a daughter of Henry Cockburn, Lord Cockburn.', 'title': 'Graham (given name)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Henry Cabot Lodge Jr. (July 5, 1902 – February 27, 1985) sometimes referred to as Henry Cabot Lodge II, was a Republican United States Senator from Massachusetts and a United States ambassador. He was the Republican nominee for Vice President in the 1960 presidential election.', 'title': 'Henry Cabot Lodge Jr.'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Vietnam competed at the 2012 Summer Paralympics in London. This was the third participation of Vietnam at the Paralympics after Athens 2004 and Beijing 2008. The country was represented by 11 competitors. The Vietnam team in 2012 comprised: Athletics: Nguyễn Thị Hải, Cao Ngọc Hùng (flagbearer), Trịnh Công Luận. Swimming: Võ Thanh Tùng. , Nguyễn Thành Trung, Dương Thị Lan, Trịnh Thị Bích Như. Powerlifting: Nguyễn Thị Hồng, Châu Hoàng Tuyết Loan, Nguyễn Văn Phúc, Nguyễn Bình An.', 'title': 'Vietnam at the 2012 Summer Paralympics'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Ngô Đình Diệm (] ; 3 January 1901\xa0– 2 November 1963) was a South Vietnamese politician. A former mandarin of the Nguyễn dynasty, he was named Prime Minister of the State of Vietnam by Head of State Bảo Đại in 1954. In October 1955, after winning a heavily rigged referendum, he deposed Bảo Đại and established the first Republic of Vietnam (RVN), with himself as president. He was a leader of the Catholic element and was opposed by Buddhists. In November 1963, after constant Buddhist protests and non-violent resistance, Diệm was assassinated during a coup d'état, along with his brother, Ngô Đình Nhu, by Nguyễn Văn Nhung, the aide of the leader of the Army of Republic of Vietnam (ARVN), General Dương Văn Minh.", 'title': 'Ngo Dinh Diem'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The High National Council (South Vietnam) ("Thượng Hội đồng Quốc gia") (8 September 1964 – 20 December 1964) was a civilian legislative assembly convened by the Military Revolutionary Council (MRC) led by the three generals Dương Văn Minh, Nguyễn Khánh and Trần Thiện Khiêm, under US pressure, after the First Republic led by Ngô Đình Diệm was overthrown by the military junta. Its ultimate objective was to prepare the constitution of the Second Republic of South Vietnam. The Council consisted of 16 well-respected citizens: Nguyễn Xuân Chữ, Tôn Thất Hanh, Nguyễn Văn Huyền, Ngô Gia Hy, Nguyễn Đình Luyện, Nguyễn Văn Lực, Trần Đình Nam, Hồ Văn Nhựt, Trần Văn Quế, Lê Khắc Quyến, Phan Khắc Sửu, Lương Trọng Tường, Hồ Đắc Thắng, Lê Văn Thu, Mai Thọ Truyền and Trần Văn Văn.', 'title': 'High National Council (South Vietnam)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Phanxicô Xaviê Nguyễn Văn Thuận or François-Xavier Nguyễn Văn Thuận (] ; 17 April 1928 – 16 September 2002), was a Cardinal in the Roman Catholic Church. He was a nephew of South Vietnam's first president, Ngô Đình Diệm, and of Archbishop Ngô Đình Thục.", 'title': 'Nguyễn Văn Thuận'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Before dawn on January 30, 1964, General Nguyễn Khánh ousted the military junta led by General Dương Văn Minh from the leadership of South Vietnam without firing a shot. It came less than three months after Minh's junta had themselves come to power in a bloody coup against then President Ngô Đình Diệm. The coup was bloodless and took less than a few hours—after power had been seized Minh's aide and bodyguard, Major Nguyễn Văn Nhung was arrested and summarily executed.", 'title': '1964 South Vietnamese coup'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Madame Nguyễn Văn Thiệu (born : Nguyễn Thị Mai Anh) served as First Lady of South Vietnam from 1967–75. She is the widow of Nguyễn Văn Thiệu a Vietnamese general and politician, who served as President of the Republic of Vietnam from 1967 until his resignation in 1975. She was born in Mỹ Tho.', 'title': 'Madame Nguyen Van Thieu'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Nguyễn Văn Lữ (, 1754 - 1787) was the one of the Tây Sơn brothers who formed Quangnam's short-lived Tây Sơn Dynasty. His older brothers were Emperor Thái Đức, common name Nguyễn Văn Nhạc and Emperor Quang Trung, common name Nguyễn Văn Huệ. After defeating the Nguyễn Lords and seizing Saigon in 1783 Nguyễn Lữ became king of the South, while Nguyễn Nhạc was crowned king of central Vietnam.", 'title': 'Nguyễn Lữ'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Nguyễn Văn Trỗi–Trần Thị Lý Bridge (Vietnamese: "Cầu Nguyễn Văn Trỗi–Trần Thị Lý" ) is a bridge spanning the Hàn River in the city of Đà Nẵng, Vietnam. The new bridge replaces two older bridges named after Nguyễn Văn Trỗi and Trần Thị Lý.', 'title': 'Trần Thị Lý Bridge'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Nguyễn Văn Trỗi (1 February 1940 – 15 October 1964) was a Việt Minh (National Liberation Front) bomber. He gained notoriety after being captured by South Vietnamese forces while trying to assassinate United States Secretary of Defense Robert McNamara and future ambassador Henry Cabot Lodge Jr. who were visiting South Vietnam in May 1963.', 'title': 'Nguyễn Văn Trỗi'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Time to Say Goodbye" is an English language song released by Greek-Swede duo Antique. It was released as a CD Single with its Greek version titled "Alli Mia Fora" (One More Time) in 2003 by Bonnier Music in Scandinavian countries.', 'title': 'Time to Say Goodbye (Antique song)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Madcon is a Norwegian musical duo formed in 1992 by Yosef Wolde-Mariam and Tshawe Baqwa. To date, they have released six albums.', 'title': 'Madcon'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Cry Baby", written and composed by Martin Isherwood, was the United Kingdom\'s entry at the Eurovision Song Contest 2003, and was performed by the duo Jemini. To date, it is the only song ever entered by the United Kingdom to earn no points (""nul points"") from any other countries. It was also the first ever English language song to receive no points.', 'title': 'Cry Baby (Jemini song)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Glow" is an English language song by the Norwegian urban duo Madcon. It is the first single released from their fourth album Contraband. The song is produced by production team Element, and written by Element and Madcon. Madcon performed the song during the Eurovision Song Contest 2010 interval in Oslo, Norway.', 'title': 'Glow (Madcon song)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Do Ya" is the debut single of the Danish pop duo Anthony Jasmin, winners of the seventh season of the Danish version of "X Factor". The English language song was their winners song in the finale of the show on 28 March 2014. The song, immediately released after the results were announced, peaked on the Tracklisten the official Danish Singles Chart at number 1.', 'title': 'Do Ya (Anthony Jasmin song)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': '"Freaky Like Me" is an English language song by the Norwegian urban duo Madcon featuring vocals from Belgian-Tunisian singer Ameerah. It is the second single released from their fourth album "Contraband". The song was written by Ameerah, TJ Oosterhuis, Arjang "DreamRoc\'a" Shishegar, Tshawe Baqwa and Yosef Wolde-Mariam and produced by Norwegian producer DreamRoc\'a, also known as Sha, and TJ Oosterhuis. It was released on 20 September 2010. The song reached number one in Norway, making it their third number one in the country and their third biggest international hit.', 'title': 'Freaky Like Me'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Outrun the Sun" is an English language song by the Norwegian urban duo Madcon featuring vocals from Maad*Moiselle. It is the third single released from their fourth album Contraband. The song was written by Jonas Jeberg, Terence Abney, Tshawe Baqwa, Yosef Wolde-Mariam, Marcella Brailsford, Kasper Larsen, Ole Brodersen. It was released on 19 November 2010.', 'title': 'Outrun the Sun'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Helluva Nite" is an English language song by the Norwegian urban duo Madcon featuring vocals from Maad*Moiselle, even though Ludacris is featured on the album, Madcon decided not to put him in the single. It is the fourth single released from their fourth album Contraband. The song was written by Jonas Jeberg, Christopher Bridges, Marcus John Bryant, Nakisha Smith, Tshawe Baqwa and Yosef Wolde-Mariam. It was released on the 26 September 2011.', 'title': 'Helluva Nite'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Commitment Issues" is the debut single of the Danish sister duo Embrace, winners of the ninth season of the Danish version of "X Factor". The English language song was their winners song in the finale of the show on 1 April 2016. The song peaked on the Hitlisten, the official Danish singles chart, at number 18.', 'title': 'Commitment Issues'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Liar" is an English language song by the Norwegian urban duo Madcon from their third studio album An InCONvenient Truth. The song was written by Kim Ofstad, Jonny Sjo, Hitesh Ceon, Yosef Woldemariam and Tshawe Shoore Baqwa and was released in 2008 in Norway and on 20 February 2009 in the UK. The song reached #2 in Norway and #65 in Germany.', 'title': 'Liar (Madcon song)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'LIVE365 is an Internet radio broadcasting and listening network where users are able to create their own online radio stations, or choose to listen to thousands of human curated stations created by people from around the globe. LIVE365 is unique in that online radio stations on the LIVE365 network were created and managed by music and talk enthusiasts, including both hobbyists and professional broadcasters. LIVE365 also has many well established AM and FM stations that utilized the LIVE365 broadcasting platform to simulcast their terrestrial radio streams via the Live365 distribution network. The Live365 network also features radio stations from well-known artists such as Johnny Cash, David Byrne, Pat Metheny, Jethro Tull, Frank Zappa, and more. LIVE365 was created in 1999, and remains one of the longest running internet radio websites for listeners and broadcasters.', 'title': 'Live365'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Twitch is a live streaming video platform owned by Twitch Interactive, a subsidiary of Amazon.com. Introduced in June 2011 as a spin-off of the general-interest streaming platform, Justin.tv, the site primarily focuses on video game live streaming, including broadcasts of eSports competitions, in addition to creative content, "real life" streams, and more recently, music broadcasts. Content on the site can either be viewed live or via video on demand.', 'title': 'Twitch.tv'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Games Done Quick is a biannual video game speedrun charity marathon held in the United States, originally organized by the Speed Demos Archive and Speedruns Live communities. Since 2015, it has been handled by Games Done Quick, LLC. Held since 2010, the events have raised money for several charities; the most common two being the Prevent Cancer Foundation and Doctors Without Borders. The events are broadcast live on Twitch. Viewers are encouraged to donate for incentives during the stream such as naming characters in a run, having the runners attempt more difficult challenges, or winning prizes. Over $12 million has been raised across seventeen marathons.', 'title': 'Games Done Quick'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Summer Games Done Quick 2016 (sometimes abbreviated as SGDQ 2016) was a speedrun charity marathon hosted by the Speedruns Live community on 3–9 July, 2016. Held at the Hilton Minneapolis Downtown in Minneapolis, Minnesota, the event consisted of 177 consecutive speedruns, spread over seven days. Participants played through a large variation of video games, including games in the "Super Mario" and "The Elder Scrolls" series. The event included multiple races, blindfolded play-throughs, and two "Tetris" competitions. Summer games Done Quick 2016 raised $1,297,924.44 USD for Doctors Without Borders, a slight improvement over the 2015\'s Summer marathon.', 'title': 'Summer Games Done Quick 2016'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Noirhouse is an award winning Australian dark comedy indie web series, starring Melanie Irons, Nathan Spencer and Mick Davies. It plays on film-noir archetypes, featuring three main characters - a shady detective, femme fatale and Russian mobster. It premiered in September 2013 with an early screening at the Peacock Threater in Hobart, before beginning broadcast on its own website for a 3 episode first series. It was picked up by the Australian Broadcasting Corporation for a six episode second season to be released on its iView broadcasting platform, to begin running in November 2014. It was originally funded by Screen Tasmania and Screen Australia.', 'title': 'Noirhouse'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Mychal Ramon Jefferson, better known under the screen name Trihex, is an American professional gamer and speedrunner. Active at the biannual Games Done Quick events, Trihex is best known for his runs of "Jet Set Radio" and "Yoshi\'s Island". He is a very popular livestreamer, with over 200,000 followers on Twitch. He is also known to be the face of the Twitch emote, TriHard.', 'title': 'Trihex'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Lee Young-ho (born 5 July 1992 이영호) is a South Korean "" and "StarCraft II" player who played Terran for the Korean pro-gaming team KT Rolster under the alias By.FlaSh or simply Flash. He is widely considered the best "StarCraft" player of all time. Lee began playing "StarCraft II" competitively in 2011, until his retirement in December 2015. He subsequently returned to playing "Starcraft: Brood War", and started his personal broadcast in February 2016 on the AfreecaTV personal broadcasting platform. Since returning to "Brood War", Lee has won first place in both Season 2 and Season 3 of the Afreeca Starleague.', 'title': 'Flash (video gamer)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Speed Demos Archive (commonly known as simply SDA) is a website dedicated to video game speedruns. SDA's primary focus is hosting downloadable, high-quality speedrun videos, and currently has runs of over eleven hundred games, with more being added on a regular basis. SDA also hosts two annual speedrunning charity marathons, Awesome Games Done Quick and Summer Games Done Quick. It has so far hosted thirteen marathons, and has raised over $10 million for various charities, with the most successful so far being Awesome Games Done Quick 2017, which raised over $2.2 million for the Prevent Cancer Foundation.", 'title': 'Speed Demos Archive'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Dash Radio is a digital radio broadcasting platform with more than 80 original stations. These stations are curated by DJs, radio personalities, musicians, and music tastemakers. The platform includes partner stations curated by Snoop Dogg, Odd Future, Kylie Jenner, Lil Wayne, Tech N9ne, Borgore, B-Real of Cypress Hill, XXL Magazine, and others. Dash Radio has no subscription fees and is commercial-free.', 'title': 'Dash Radio'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Quake done Quick is a series of machinima and speedrun movies in which Quake, its mission packs, and a few of its related games, are completed as fast as possible, utilizing any shortcut or trick, such as bunny hopping and rocket jumping (but not cheats) necessary. These movies are available in the game engine's native demo format and in rendered multimedia versions such as AVI files.", 'title': 'Quake Done Quick'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Promises and Lies is the tenth album by the British reggae band UB40, released in 1993. It includes the hit from the soundtrack of the 1993 movie "Sliver", "Can\'t Help Falling in Love", originally sung by Elvis Presley. The album reached No. 1 in the UK and No. 6 in the United States. It is the band\'s best-selling album (over 9 million copies).', 'title': 'Promises and Lies'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Mark Buntzman is the film director, writer, producer and actor of the cult classic movie "Exterminator 2", and was also the producer of the first, "The Exterminator". Other than those two movies, he hasn\'t produced, directed, or written any other prominent films. He did, though, have a cameo in the 1993 movie "Posse" as Deputy Buntzman, as well as playing a reporter in the 1995 movie "Panther". Both movies starred Mario Van Peebles, who also played a large role in "Exterminator 2".', 'title': 'Mark Buntzman'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Scott Spencer (born September 1, 1945 in Washington, D.C.) is an American author who has written eleven novels. He also wrote the screenplay for the 1993 movie "Father Hood". Two of Spencer\'s novels, "Endless Love" and "Waking the Dead," have been adapted into films. "Endless Love" was first adapted into a motion picture by Franco Zeffirelli in 1981, and a second adaptation by Shana Feste was released in 2014. " Waking the Dead" was produced by Jodie Foster and directed by Keith Gordon in 2000. The novels "Endless Love" and "A Ship Made of Paper" have both been nominated for the National Book Award, with "Endless Love" selling over 2 million copies. Spencer has heavily panned both film adaptations of "Endless Love".', 'title': 'Scott Spencer (writer)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Michelle Burke (born Michelle Gray; November 30, 1970) is an American actress. She is best known for her roles as Jodi Kramer in the 1993 Richard Linklater film "Dazed and Confused" and as Connie Conehead in the 1993 movie "Coneheads". She also appeared in the 1994 sequel to "Major League", "Major League II".', 'title': 'Michelle Burke'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Jennifer Cecily Ward-Lealand, ONZM (born 8 November 1962 ), is a New Zealand screen and theatre actress whose screen CV includes starring in 1993 movie "Desperate Remedies", and appearances in "The Footstep Man", soap "Shortland Street" and Australian comedy series "Full Frontal".', 'title': 'Jennifer Ward-Lealand'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Kurt Bestor (born 1958) is an American keyboardist and composer specializing in new-age, film scores, and jazz. He is known for his synthesizer-based Christmas music similar to Mannheim Steamroller Christmas, some of which were featured on the Weather Channel during the holiday season in the 1980s and \'90s. His well-known songs are "Prayer of the Children", "Mama Don\'t You Weep". He is also known for composing music for the 1993 movie "Rigoletto", and for writing music for the 2002 Salt Lake City Olympic games, as well as various official The Church of Jesus Christ of Latter-day Saints videos.', 'title': 'Kurt Bestor'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Larenz Tate (born September 8, 1975) is an American film and television actor. He’s best known for his roles as Peter Waters in "Crash" and as O-Dog in the 1993 hood film, "Menace II Society". His other films include "Dead Presidents", "Love Jones", "Why Do Fools Fall in Love", "A Man Apart", "Waist Deep", "Biker Boyz", and "Ray".', 'title': 'Larenz Tate'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Streiht Up Menace" is a 1993 single by MC Eiht off the soundtrack of 1993 movie "Menace II Society". The lyrics of the song focus on the life of the characters in the movie, acting as a sort of plot summary for the film. Compton\'s Most Wanted also did this with another song from a soundtrack with the song "Growin\' Up In The Hood" from the "Boyz n the Hood" soundtrack.', 'title': 'Streiht Up Menace'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The Inkwell is a 1994 romantic comedy/drama film, directed by Matty Rich. The film stars Larenz Tate, Joe Morton, Suzzanne Douglass, Glynn Turman, Jada Pinkett Smith and Vanessa Bell Calloway.', 'title': 'The Inkwell'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Darrell Britt-Gibson is an American actor, known for his role as Darius "O-Dog" Hill on the HBO series "The Wire". He has also appeared on the Showtime series "Californication", the Starz series "Power", and the FX series "You\'re the Worst". In 2016, he starred in the films "Keanu" and "20th Century Women".', 'title': 'Darrell Britt-Gibson'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Merrill Boyd Jenson (born January 20, 1947) is an American composer and arranger who has composed film scores for over thirty films including , , The Testaments of One Fold and One Shepherd, , Harry's War, and Windwalker. Many of the films Jenson composed music for were directed by Academy Award-winning director Kieth Merrill. Jenson has also composed several concert productions including a symphony that premiered at Carnegie Hall. Additionally, he has composed music for many television commercials including the acclaimed Homefront ads, music for three outdoor pageants, and several albums. Jenson lives in Provo, Utah with his wife Betsy Lee Jenson.", 'title': 'Merrill Jenson'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The music for the 2013 action role-playing game "", developed and published by Square Enix, was composed by Masashi Hamauzu, Naoshi Mizuta, and Mitsuto Suzuki. Hamauzu was the leader composer for "XIII" and "XIII-2", and Mizuta and Suzuki previously composed music for "XIII-2". Musicians who had previously worked with the composers on "XIII-2" and "The 3rd Birthday" worked on the project in Japan, while the main soundtrack was performed and recorded in Boston by the Video Game Orchestra, conducted by Shota Nakama. Along with including more percussion and ethnic elements, the soundtrack used "Blinded by Light", the main theme for main character Lightning, as a leitmotif. Unlike the previous "XIII" games, the soundtrack did not include a theme song, as the composers felt it would detract from the emotional impact of the ending.', 'title': 'Music of Lightning Returns: Final Fantasy XIII'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Down on the Farm is a 1941 American short animated film directed by Tex Avery. It was nominated for an Academy Award at the 14th Academy Awards for Best Short Subject (One-Reel).', 'title': 'Down on the Farm (1941 film)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Dan Crow is a performer of children\'s songs. He is best known for performing the theme song ("Walk Outside") of the movie "The Adventures of Milo and Otis", but also composed many Disney songs, most significantly for Winnie the Pooh and Dumbo. He also performed on a Baby Songs spinoff video, and regular appearances on children\'s educational channels like Noggin and The Learning Channel, as well as his own commercial video and audio recordings.', 'title': 'Dan Crow (musician)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Jan Novák (8 April 1921, Nová Říše – 11 November 1984, Neu Ulm) was a popular Czech composer of classical music. Novák was primarily active in the 1960s and composed the music for several films of Karel Kachyňa. Novák also composed music for the films of animators Jiří Trnka and Karel Zeman, the leading figures of the Czech animated film, as well as for "Wir" (1982, TV film) (based on "We", the 1921 Russian novel by Yevgeny Zamyatin).', 'title': 'Jan Novák (composer)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Dumbo is a 1941 American animated film produced by Walt Disney Productions and released by RKO Radio Pictures. The fourth Disney animated feature film, it is based upon the storyline written by Helen Aberson and illustrated by Harold Pearl for the prototype of a novelty toy ("Roll-a-Book"). The main character is Jumbo Jr., a semi-anthropomorphic elephant who is cruelly nicknamed "Dumbo". He is ridiculed for his big ears, but in fact he is capable of flying by using his ears as wings. Throughout most of the film, his only true friend, aside from his mother, is the mouse, Timothy – a relationship parodying the stereotypical animosity between mice and elephants.', 'title': 'Dumbo'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Reluctant Dragon is a 1941 American live action and animated film produced by Walt Disney, directed by Alfred Werker, and released by RKO Radio Pictures on June 20, 1941. Essentially a tour of the then-new Walt Disney Studios facility in Burbank, California, the film stars radio comedian Robert Benchley and many Disney staffers such as Ward Kimball, Fred Moore, Norman Ferguson, Clarence Nash, and Walt Disney, all as themselves.', 'title': 'The Reluctant Dragon (1941 film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Naoki Satō (佐藤 直紀 , Satō Naoki , born May 2, 1970 in Chiba, Japan) is a Japanese composer who has provided the music for several popular anime series including the first five "Pretty Cure" series, "X", "Eureka Seven", "Sword of the Stranger", and "Blood-C". He graduated from the Tokyo College of Music in 1993. At the 29th Japan Academy Prize in 2006, he won the Best Music prize for his work on the film "Always Sanchōme no Yūhi (Always Sunset on Third Street)". He also composed music for anime films such as "Pretty Cure All Stars DX" trilogy, "Stand By Me Doraemon". In live-action dramas, he provided music and soundtracks for TV dramas "Good Luck!! " "Water Boys", "H2: Kimi to Ita Hibi" and "Ryōmaden". He provided the music for the "Space Battleship Yamato" film, as well as the "Rurouni Kenshin" and "" live-action film series. For the 38th Japan Academy Prize in 2015, he was nominated in the Best Score category for his work in "The Eternal Zero". While he did not win the award, "The Eternal Zero" won several awards including Best Picture, and "Stand By Me Doraemon" won for Best Animated Film.', 'title': 'Naoki Satō'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Three Sons o' Guns is a 1941 American comedy film directed by Benjamin Stoloff and written by Fred Niblo, Jr.. The film stars Wayne Morris, Marjorie Rambeau, Irene Rich, Tom Brown, William T. Orr, Susan Peters and Moroni Olsen. The film was released by Warner Bros. on August 2, 1941.", 'title': "Three Sons o' Guns"}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Dumbo was the code name used by the United States Navy during the 1940s and 1950s to signify search and rescue missions, conducted in conjunction with military operations, by long-range aircraft flying over the ocean. The purpose of Dumbo missions was to rescue downed American aviators as well as seamen in distress. Dumbo aircraft were originally land-based heavy bomber aircraft converted to carry an airborne lifeboat to be dropped in the water near survivors. The name "Dumbo" came from Walt Disney\'s flying elephant, the main character of the animated film "Dumbo", appearing in October 1941.', 'title': 'Dumbo (air-sea rescue)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Skelly Oil Company was a medium-sized oil company founded in 1919 by William Grove (Bill) Skelly, Chesley Coleman Herndon and Frederick A. Pielsticker in Tulsa, Oklahoma. J.\xa0Paul Getty acquired control of the company during the 1930s. Skelly Oil became part of Getty Oil Company, Mission Oil Company, Tidewater Oil Company. It became defunct when absorbed by Getty Oil Company in 1974, and the abandoned Skelly brand logo was revived by Nimmons-Joliet Development Corp. in 2012.', 'title': 'Skelly Oil'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Carabobo is an oil field located in Venezuela's Orinoco Belt. As one of the world's largest accumulations of recoverable oil, the recent discoveries in the Orinoco Belt have led to Venezuela holding the world's largest recoverable reserves in the world, surpassing Saudi Arabia in July 2010. The Carabobo oil field is majority owned by Venezuela's national oil company, Petroleos de Venezuela SA (PDVSA). Owning the majority of the Orinoco Belt, and its estimated 1.18 trillion barrels of oil in place, PDVSA is now the fourth largest oil company in the world. The field is well known for its extra Heavy crude oils, having an average specific gravity between 4 and 16 °API. The Orinoco Belt holds 90% of the world's extra heavy crude oils, estimated at 256 billion recoverable barrels. While production is in its early development, the Carabobo field is expected to produce 400,000 barrels of oil per day.", 'title': 'Carabobo Field'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Founded in 1908 by oil exploration pioneer E. W. Marland, The 101 Ranch Oil Company was located on the Miller Brothers 101 Ranch and headquartered in Ponca City, Oklahoma. The company’s 1911 oil discovery in North Eastern Oklahoma opened up oil development in a great region from Eastern Oklahoma west to Mervine, Newkirk, Blackwell, Billings and Garber and led to the founding of the Marland Oil Company, later renamed the Continental Oil Company, now known as Conoco.', 'title': '101 Ranch Oil Company'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Aghajari oil field is an iranian oil field located in Khuzestan Province. It was discovered in 1938 and developed by National Iranian Oil Company. It began production in 1940 and produces oil. The total proven reserves of the Aghajari oil field are around 30 billion barrels (3758×10tonnes), and production is centered on 300000 oilbbl/d . The field is owned by state-owned National Iranian Oil Company (NIOC) and operated by National Iranian South Oil Company (NISOC).', 'title': 'Aghajari oil field'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Robert Earl Holding (November 29, 1926 – April 19, 2013) was an American businessman who owned Sinclair Oil Corporation, the Little America Hotels, the Grand America Hotel, the Westgate Hotel in San Diego, California (directed by Georg Hochfilzer), and two ski resorts, Sun Valley in central Idaho since 1977, and Snowbasin near Ogden, Utah, since 1984.', 'title': 'Robert Holding'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Rag Sefid oil field is an oil field located in Khuzestan Province, approximately 6\xa0km in nearest distance from the Persian Gulf, southwest Iran. It was discovered in 1964 and developed by National Iranian Oil Company and began production in 1966. The total proven reserves of the Rag Sefid oil field are around 14,5 billion barrels, and production is centered on 180000 oilbbl/d . The field is owned by state-owned National Iranian Oil Company (NIOC) and operated by National Iranian South Oil Company (NISOC).', 'title': 'Rag Sefid oil field'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'A4 Holding S.p.A. known as Gruppo A4 Holding (previously as Serenissima Group), is an Italian holding company based in Verona, Veneto region. The company owned "Autostrada Brescia Verona Vicenza Padova" (100%), the operator of Brescia–Padua section of Autostrada A4 and Autostrada A31 (Rovigo via Vicenza to Piovene Rocchette), as well as an equity interests in Autostrada del Brennero, the operator of Autostrada A22 (Modena to Brenner Pass; 4.2327% stake via "Serenissima Partecipazioni" which A4 Holding owned 99.999% stake) and Autostrade Lombarde, the parent company of the operator of Autostrada A35 (Brescia to Milan; 4.90% stake via "Autostrada Brescia–Padova").', 'title': 'A4 Holding'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Sinclair Oil Corporation is an American petroleum corporation, founded by Harry F. Sinclair on May 1, 1916, as the Sinclair Oil and Refining Corporation by combining the assets of 11 small petroleum companies. Originally a New York corporation, Sinclair Oil reincorporated in Wyoming in 1976. The corporation's logo features the silhouette of a large green dinosaur.", 'title': 'Sinclair Oil Corporation'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Ahvaz oil field is an Iranian oil field located in Ahvaz, Khuzestan Province. It was discovered in 1953 and developed by National Iranian Oil Company. It began production in 1954. Ahvaz field is one of the richest oil fields in the world with an estimated proven reserves are around , and production is centered on 750000 oilbbl/d . The field is owned by state-owned National Iranian Oil Company (NIOC) and operated by National Iranian South Oil Company (NISOC).', 'title': 'Ahvaz Field'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Little America is a census-designated place (CDP) in Sweetwater County, Wyoming, United States. The population was 68 at the 2010 census. The community got its name from the Little America motel, which was purposefully located in a remote location as a haven, not unlike the base camp the polar explorer Richard E. Byrd set up in the Antarctic in 1928. However, being situated on a coast-to-coast highway and offering travel services, it thrived, launching a chain of travel facilities by the same name. Its developer, Robert Earl Holding, died on April 19, 2013, with a personal net worth of over $3 billion.', 'title': 'Little America, Wyoming'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Del Monte Center is an open-air shopping center located in Monterey, California. Del Monte Center is the largest shopping center on the Monterey Peninsula and the second largest shopping mall in Monterey County, California, and has the only department store in a 22-mile radius. Del Monte Center was designed by architect John Carl Wernecke, built by Williams and Burrows Construction Company and originally opened in 1967 but expanded and renovated in 1987. The shopping center encompasses 675000 sqft of retail space including 85 stores, one department store (Macy's), Whole Foods Market, restaurants (California Pizza Kitchen, P.F. Chang's China Bistro, Pizza My Heart, Islands Fine Burgers & Drinks, Subway, Chipotle Mexican Grill, Starbucks and Lalla Grill), a gym and spa (Energia) and a thirteen screen Century Theatres. Petco was added in 2004, replacing Stroud's. The existing theater complex moved in 2006, with the former complex becoming a furniture store for Macy's.", 'title': 'Del Monte Center'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Westland Mall was an 860000 sqft shopping center located on the west side of Columbus, Ohio, at the western intersection of U.S. Route 40 and Interstate 270.', 'title': 'Westland Mall (Columbus)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Springdale Mall is a shopping center located in Mobile, Alabama, United States, directly across from Bel Air Mall. Opened in 1959 as an open-air shopping center, Springdale Mall was later redeveloped as an enclosed shopping center. Facing competition from larger shopping centers in the area, Springdale was demolished in stages in the 2000s, with most of the former enclosed mall being replaced with big box stores.', 'title': 'Springdale Mall'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Park City Center is a shopping mall located in Lancaster, Pennsylvania, and is the largest enclosed shopping center in Lancaster County. It is situated at the intersection of U.S. Route 30 and Harrisburg Pike. The shape of the mall resembles a snowflake, with its stores occupying 8 corridors extending from the center. The roof in the center of the mall is a large white tent, and encloses the octagonal Center Court. The mall underwent a major renovation in 2008, which took 18 months and included updates to every part of the mall. During its early years Park City was also called "Mall of Four Seasons" because of the seasonal names given to the 4 corridors leading to each anchor. Going clockwise from west to east was JC Penney in the two-story Winter quadrant, Sears in Spring, Gimbel\'s (future Pomeroy\'s/Boscov\'s) in Summer and Watt & Shand (later Bon-Ton) in Autumn. The high tech mall located in the heart of Amish country was one of the first to have its own closed-circuit television. Studios for Park City Communications and Lancaster/York/Harrisburg CBS affiliate WLYH-TV 15 were located on the first floor in the Winter wing alongside an ice skating rink.', 'title': 'Park City Center'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Bulgaria Mall was officially opened on 1 December 2012 and is the first shopping center in Sofia and Bulgaria which will be positioned as an upper scale mall, focusing on the proper combination of medium to premium international brands with the highest quality Bulgarian retailers. Owners of Bulgaria mall are Myles Summerfield and Nikola Yanakiev. More specifically, the shopping center is positioned at the intersection of two of the most significant Sofia's boulevards – Bulgaria boulevard and Todor Kableshkov boulevard. Bulgaria Mall has an exceptional location, close to the downtown (less than a 10 min. drive), the Ring Road (app. 2 min. drive) and some of the most affluent residential quarters of Sofia. The mall will be developed as part of a mixed-use retail and office project with approximately 130,000 m² of total built-up area (33,000 m² for the commercial area). The shopping center will include four underground (parking and a hypermarket of approx. 5,600 m²) and four above ground levels with retail and entertainment. The parking will provide more than 1,100 lots with very convenient entrances to each underground parking deck. The office part, which will consist of an office high-rise tower and an office building, will exceed 25,000 m² of lettable area.", 'title': 'Bulgaria Mall'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Springfield Town Center is an shopping center in Springfield, Virginia. It opened in 1973 as Springfield Mall, an enclosed shopping mall, which closed on June 30, 2012 as part of a multimillion-dollar redevelopment plan to turn it into a multifaceted "Town Center"-style shopping center with a main indoor area similar to the nearby Tysons Corner Center and Dulles Town Center, while transforming the exterior into a pedestrian friendly environment with restaurants with cafe style outdoor seating and entrances. It is located at the intersection of Interstate 95 and Franconia Road (Route 644), which is part of the Springfield Interchange, 1/4 mile north of Franconia-Springfield Parkway (State Route 289) and the Franconia-Springfield Metro station. The mall reopened on October 17, 2014 following its two-year renovation.', 'title': 'Springfield Town Center'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Ballston Common Mall, which originally opened as Parkington Shopping Center in 1951, was one of the first major suburban shopping centers in the Washington D.C. area. It was the first shopping center built around a multi-story parking garage in the United States. It was located at the intersection of Glebe Road (Virginia State Route 120) and Wilson Boulevard in the Ballston neighborhood of Arlington, Virginia, two blocks from Ballston-MU Station on the Washington Metro's Orange and Silver lines. The Ballston Common mall opened on October 20, 1986, and was a $40 million replacement for the Parkington Shopping Center. The 530000 sqft center was developed in limited partnership with the May Centers, a subsidiary of the May Company who, at the time, also owned one of the anchors, Hecht's.", 'title': 'Ballston Common Mall'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Northland Mall was a shopping mall located on the north side of Columbus, Ohio, at the intersection of Morse Road and Karl Road. It opened in 1964 as an open-air shopping center and the first shopping mall in Columbus. Northland was the first of the four directionally-named shopping hubs in Columbus, along with Eastland (1967), Westland (1969) and Southland (1975) [a small strip center, now closed]. Though popular through the 1990s, three new shopping centers were completed in the late 1990s and early 2000s that took businesses and shoppers away from Northland. It closed in 2002 and was demolished in 2004. The site has subsequently been redeveloped as Northland Village, a multi-use complex containing government offices, retail stores and the Franklin County Dog Shelter and Adoption Center.', 'title': 'Northland Mall'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Oaks Shopping Center is a two-level indoor/outdoor, super-regional shopping mall located in Thousand Oaks, California. It is owned and managed by Macerich. Accessible from the US Highway 101 Ventura Freeway midway between downtown Los Angeles and Santa Barbara, it is one of two malls in its area (competing with the Simi Valley Town Center) and the largest shopping center in Ventura County. The 1300000 sqft mall was originally built in 1978 and was renovated in 1993. Starting in February 2007, the center has undergone an extensive upgrade including interior finishes, restrooms, entrance canopies and skylights to reflect a modern Spanish and Santa Barbara-influenced design. The expansion includes a demolition of the then-vacated Broadway building and a Muvico 14-screen stadium seat theater and Bogarts, a full-service restaurant, built in its place. Additional features include a 10-unit Spanish Dining Hall and amenities like family restrooms with granite, stacked flagstone and limestone tile. Centered on the theatre are four sit-down restaurants: Lazy Dog Cafe and Red Robin, which are both connected to a 112330 sqft retail expansion in an outdoor environment, while Olive Garden and Red Lobster are located across the parking lot. The Cheesecake Factory is located inside the Shopping Center with patio dining available.', 'title': 'The Oaks (Thousand Oaks, California)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Bay Plaza Shopping Center is a shopping center on the south side of Co-op City, in the Bronx, New York. In addition to various department stores and shops, such as Macy's, JCPenney, Staples, Kmart and Old Navy, it has a multiplex movie theater, several restaurants, a fitness club, and some office space. It used to operate a Barnes and Nobles bookstore across the mall but was shut down. Constructed from 1987 to 1988 by Prestige Properties, the shopping center is located between Bartow and Baychester Avenues, just outside Sections 4 and 5 of Co-op City, on an open lot that from 1960 to 1964, was the site of Freedomland USA. The Bay Plaza Shopping Center is the largest shopping center in New York City. Since opening over 25 years ago, it has become extremely successful, the center claims to hold some of the highest performing stores on a per-square-foot basis for many national retailers.", 'title': 'Bay Plaza Shopping Center'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Torre Cepsa (renamed in June 2014, before was Torre Bankia) (English: Cepsa Tower ) is a skyscraper located in the Cuatro Torres Business Area in Madrid, Spain. With a height of 248.3 m and 45 floors, it is the second tallest of the four buildings in the Cuatro Torres Business Area complex, surpassed by Torre de Cristal less than a metre. It is the second tallest building in Spain and the 5th tallest building in the European Union.', 'title': 'Torre Cepsa'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "This list of tallest buildings in New Jersey ranks skyscrapers and high-rises in the U.S. state of New Jersey by height. The tallest building in New Jersey is the 42-story 30 Hudson Street, known widely as the Goldman Sachs Tower, which rises 781 feet (238 m) at Exchange Place in Jersey City. It is also the 69th-tallest building in the United States. The second tallest building in New Jersey is the 57-story Revel Resort, which rises 709 ft (216 m) in Atlantic City and ranks as the second tallest casino tower in the United States. The National Newark Building was the tallest building in the state between 1931 and 1989. If built, a proposed 950 ft residential building in Downtown Jersey City would become the state's tallest.", 'title': 'List of tallest buildings in New Jersey'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'U.S. Bank Tower, formerly Library Tower and First Interstate Bank World Center, is a 1018 ft skyscraper at 633 West Fifth Street in downtown Los Angeles, California. It is the third tallest building in California, the second tallest building in LA, the fifteenth tallest in the United States, the third tallest west of the Mississippi River after the Salesforce Tower and the Wilshire Grand Center, and the 92nd tallest building in the world, after being surpassed by the Wilshire Grand Center. Because local building codes required all high-rise buildings to have a helipad, it was known as the tallest building in the world with a roof-top heliport from its completion in 1989 to 2004 when Taipei 101 opened. It is also the third tallest building in a major active seismic region; its structure was designed to resist an earthquake of 8.3 on the Richter scale. It consists of 73 stories above ground and two parking levels below ground. Construction began in 1987 with completion in 1989. The building was designed by Henry N. Cobb of the architectural firm Pei Cobb Freed & Partners and cost $350 million to build. It is one of the most recognizable buildings in Los Angeles, and often appears in establishing shots for the city in films and television programs.', 'title': 'U.S. Bank Tower (Los Angeles)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '112 Tryon Plaza is a 280 ft 22-story skyscraper in Charlotte, North Carolina. It was the second tallest building in North Carolina when completed in 1927, and the tallest building in Charlotte for about 35 more years. It is currently the 21st tallest building in the city. Located on "The Square" at the corner of Trade St. and Tryon St. adjacent to a pocket park, this building has a premiere location in Uptown Charlotte, also known as Charlotte center city. In 2006 it was sold for USD $12 million to the Simpson Organization.', 'title': '112 Tryon Plaza'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "The Hyperion Tower (Korean: 하이페리온 타워), also known as the Mok-dong Hyperion Towers, is a group of three buildings located in the Yangcheon-gu district of Seoul, South Korea, completed in 2003. The tallest of which, Tower A, is 69 storeys and 256 metres (840 feet) high, making it the second tallest building in Seoul and the world's 214th tallest building. The towers are used as residential housing. Tower A is the world's 19th tallest residential building. Below the building is the Hyundai Department store, a chain of high end department stores in South Korea. At the time of its completion, the building was the tallest in the country but was surpassed by Samsung Tower Palace 3 – Tower G in 2004.", 'title': 'Hyperion Tower'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The MesseTurm (English: "Trade Fair Tower" ) is a 63-storey, 257 m skyscraper in the Westend-Süd district of Frankfurt, Germany. It is the second tallest building in Frankfurt, the second tallest building in Germany and the third tallest building in the European Union. It was the tallest building in Europe from its completion in 1991 until 1997 when it was surpassed by the Commerzbank Tower, which is also located in Frankfurt.', 'title': 'Messeturm'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "This list of tallest buildings in Indianapolis ranks skyscrapers and high-rises in the U.S. city of Indianapolis, Indiana, by height. Majority of the skyscrapers are located in Downtown Indianapolis. The tallest building in the city is the 49-story SalesforceTower, which rises 811 ft and was completed in 1990. The structure is the tallest completed building in the state and the 49th-tallest building in the U.S. In addition, it is the tallest building in the Midwest outside of Chicago and Cleveland. The city's second tallest structure is the OneAmerica Tower, which was the tallest building in Indiana from 1982 until 1990. Of the 40 tallest buildings in Indiana, 34 are located in Indianapolis.", 'title': 'List of tallest buildings in Indianapolis'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "The Willis Tower, built as and still commonly referred to as the Sears Tower, is a 110-story, 442.1 m skyscraper in Chicago, Illinois, United States. At completion in 1973, it surpassed the World Trade Center towers in New York to become the tallest building in the world, a title it held for nearly 25 years and remained the tallest building in the Western Hemisphere until 2014 and the completion of a new building at the World Trade Center site. The building is considered a seminal achievement for its architect Fazlur Rahman Khan. The Willis Tower is the second-tallest building in the United States and the 16th-tallest in the world. More than one million people visit its observation deck each year, making it one of Chicago's most popular tourist destinations. The structure was renamed in 2009 by the Willis Group as part of its lease on a portion of the tower's space.", 'title': 'Willis Tower'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "This list of tallest buildings in Corpus Christi ranks high-rises in the U.S. city of Corpus Christi, Texas by height. The tallest building in Corpus Christi is the 28-story One Shoreline Plaza South Tower, which rises 411 feet (125 m) and was completed in 1988. It also stands as the tallest building in Texas south of San Antonio. The building is located on a complex which also contains the second tallest building in the city at 375 feet (114 m). The third tallest building is the Frost Bank Plaza. It stood as the city's tallest building from 1983 to 1988.", 'title': 'List of tallest buildings in Corpus Christi'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "WFMT is an FM radio station in Chicago, Illinois, featuring a format of fine arts, classical music programming, and shows exploring such genres as folk and jazz. The station is managed by Window To The World Communications, Inc., owner of WTTW, one of Chicago's two Public Broadcasting Service (PBS) Public television stations. WFMT is also the primary station of the WFMT Radio Network, and the Beethoven and Jazz Networks. WFMT transmits from the Willis (Sears) Tower.", 'title': 'WFMT'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Ferrara (] \xa0\xa0 ) (Emilian: Frara) is a city and "comune" in Emilia-Romagna, northern Italy, capital city of the Province of Ferrara. It is situated 50 km north-northeast of Bologna, on the Po di Volano, a branch channel of the main stream of the Po River, located 5 km north. The town has broad streets and numerous palaces dating from the 14th and 15th centuries, when it hosted the court of the House of Este. For its beauty and cultural importance it has been qualified by UNESCO as a World Heritage Site.', 'title': 'Ferrara'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Joachim Patinir, also called Patenier (c. 1480 – 5 October 1524), was a Flemish Renaissance painter of history and landscape subjects. He was Flemish, from the area of modern Wallonia, but worked in Antwerp, then the centre of the art market in the Low Countries. Patinir was a pioneer of landscape as an independent genre and he was the first Flemish painter to regard himself primarily as a landscape painter. He effectively invented the world landscape, a distinct style of panoramic northern Renaissance landscapes which is Patinir's important contribution to Western art.", 'title': 'Joachim Patinir'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Sofonisba Anguissola (c.\u20091532 \xa0– 16 November 1625), also known as Sophonisba Angussola or Anguisciola, was an Italian Renaissance painter born in Cremona to a relatively poor noble family. She received a well-rounded education, that included the fine arts, and her apprenticeship with local painters set a precedent for women to be accepted as students of art. As a young woman, Anguissola traveled to Rome where she was introduced to Michelangelo, who immediately recognized her talent, and to Milan, where she painted the Duke of Alba. The Spanish queen Elizabeth of Valois was a keen amateur painter, and in 1559 Anguissola was recruited to go to Madrid as her tutor, with the rank of lady-in-waiting. She later became an official court painter to the king, Philip II, and adapted her style to the more formal requirements of official portraits for the Spanish court. After the queen's death, Philip helped arrange an aristocratic marriage for her. She moved to Sicily, and later Pisa and Genoa, where she continued to practice as a leading portrait painter, living to the age of ninety-three.", 'title': 'Sofonisba Anguissola'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Giovanni Ambrogio de Predis (Preda, c. 1455 – Milan, c. 1508) was an Italian Renaissance painter, illuminator and designer of coins active in Milan. Ambrogio gained a reputation as a portraitist, including as a painter of miniatures, at the court of Ludovico Sforza.', 'title': 'Giovanni Ambrogio de Predis'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Parma Cathedral (Italian: "Duomo di Parma; Cattedrale di Santa Maria Assunta" ) is a Roman Catholic cathedral in Parma, Emilia-Romagna (Italy), dedicated to the Assumption of the Blessed Virgin Mary. It is the episcopal seat of the Diocese of Parma. It is an important Italian Romanesque cathedral: the dome, in particular, is decorated by a highly influential illusionistic fresco by Renaissance painter Antonio da Correggio.', 'title': 'Parma Cathedral'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Ridolfo Ghirlandaio (or Ghirlandajo) (Florence 14 February 1483 – 6 June 1561) was an Italian Renaissance painter active mainly in Florence. Ridolfo Ghirlandaio was the son of the Italian Renaissance painter Domenico Ghirlandaio.', 'title': 'Ridolfo Ghirlandaio'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Ercole Grandi (1491–1531) was an Italian painter of the early-Renaissance period, active mainly in Ferrara. Also known as Ercole da Ferrara and Ercole di Giulio Cesare Grandi, he has been claimed to be a favourite pupil of the painter Lorenzo Costa. Ercole Grandi first appeared in the historical record as being in the service of the house of Este in 1489. Between 1489 and 1495, Ercole Grandi seems to have been working in Bologna, both in San Petronio and in the Cappella Bentivoglio of San Giacomo Maggiore, as an assistant to Lorenzo Costa. In 1495, he was in Ferrara as the chief architect for realising Duke Ercole's plans to embellish the city and renovate the churches; the facade and interior of Santa Maria in Vado were executed from his design. He worked with Ludovico Mazzolino and others on the decoration of the Castello, and painted in the apartments of Lucretia Borgia. Also in Ferrara, he painted the frescoes for the church of San Pietro Martire (now demolished), although some frescoes are preserved. One problem in assigning attribution to the hand of Ercole Grandi is that none of his works is signed or dated, or accompanied by supporting documents, but he is thought by some scholars to have painted -- in the manner of Mantegna -- or had a hand in, the decorative frescoed ceiling in the Sala del Tesoro of the Palazzo Costabili (Palazzo di Ludovico il Moro) in Ferrara between 1503 and 1506. Other scholars attribute the work to Benvenuto Tisi da Garofalo. Confusingly, the identity of Ercole Grandi is sometimes conflated with Garofalo, and an Ercole da Bologna, and (most famously by the Renaissance historian, Giorgio Vasari) with that of Ercole di Antonio Roberti or Ercole de' Roberti (and see Filippini), who was first documented as being in Ferrara in 1479, and was author of the great frescoes of the Garganelli chapel in Bologna. Most of Ercole Grandi's works have been reattributed to other Ferrarese painters, such as Giovan Francesco Maineri and Lorenzo Costa, while other scholars insist that Ercole Grandi is a mythical character.", 'title': 'Ercole Grandi'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Pedro Berruguete (c. 1450 – 1504) was a Spanish painter; his art is regarded as a transitional style in Spain between gothic and Renaissance. Berruguete most famously created paintings of the first few years of the Inquisition and of religious imagery for Castilian retablos. He is considered by some as the first Renaissance painter in Spain. He was the father of an important sculptor, Alonso Berruguete, considered the most important sculptor in Renaissance Spain. Because of the fame accrued by Alonso, Pedro Berruguete is sometimes referred to as Berruguete el Viejo (or Berruguete the Older) to differentiate between the two.', 'title': 'Pedro Berruguete'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Ludovico Mazzolino (1480 – c. 1528) - also known as Mazzolini da Ferrara, Lodovico Ferraresa, and Il Ferrarese - was an Italian Renaissance painter active in Ferrara and Bologna.', 'title': 'Ludovico Mazzolino'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Tiriolo is a town and "comune" in the province of Catanzaro in the Calabria region of southern Italy. It was the birthplace of Renaissance painter Marco Cardisco.', 'title': 'Tiriolo'}]

