 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The 1972 New Zealand Open, also known as Benson and Hedges Open for sponsorship reasons, was a combined men's and women's professional tennis tournament held at the Stanley Street Courts in Auckland, New Zealand. It was an independent event, i.e. not part of the 1972 Grand Prix or 1972 World Championship Tennis circuit. The tournament was played on outdoor grass courts and was held from 7 December through 12 December 1971. Ray Ruffels and Kerry Melville won the singles titles.", 'title': '1972 New Zealand Open'}
