 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Bob Hewitt and Frew McMillan were the defending champions, but Hewitt did not participate this year. McMillan partnered Bob Carmichael, losing in the semifinals.', 'title': '1979 U.S. Pro Indoor – Doubles'}
