 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Karting World Championship is ruled by the CIK-FIA. It takes place once a year, each year in a different country, and is kart racing's flagship event. From 2011 the championship has been disputed over five rounds, each of them in a different country.", 'title': 'Karting World Championship'}
