[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Journal of the International Phonetic Association is a peer-reviewed academic journal that appears three times a year. It is published by Cambridge University Press on behalf of the International Phonetic Association. It was established as "Le Maître Phonétique" in 1886 and obtained its current name in 1971. It covers topics in phonetics and applied phonetics such as speech therapy and voice recognition. The editor-in-chief is Adrian P. Simpson (Friedrich-Schiller-Universität). The journal is abstracted and indexed in the MLA Bibliography.', 'title': 'Journal of the International Phonetic Association'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Journal of Private Enterprise is a peer-reviewed academic journal of economics published by the Association of Private Enterprise Education. It was established in 1985 and appears twice a year. Edward Stringham (Fayetteville State University) has been the editor-in-chief since 2006. The journal is abstracted and indexed in ABI/Inform-Proquest, EBSCO databases, EconLit, the "Journal of Economic Literature", Handelsblatt Ranking VWL, and Scopus.', 'title': 'Journal of Private Enterprise'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Estuarine, Coastal and Shelf Science is a peer-reviewed academic journal on ocean sciences, with a focus on coastal regions ranging from estuaries up to the edge of the continental shelf. It\'s published by Elsevier on behalf of the Estuarine Coastal Sciences Association and edited by T.S. Bianchi, M. Elliott, I. Valiela, and E. Wolanski. The journal began in 1973 as "Estuarine and Coastal Marine Science" before the name was changed in 1981. The journal is abstracted and indexed in the Science Citation Index, Scopus, PASCAL, Biosis, INSPEC, Geobase, and Academic Search Premier. According to the "Journal Citation Reports", the journal has a 2014 impact factor of 2.057.', 'title': 'Estuarine, Coastal and Shelf Science'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'In the Library with the Lead Pipe is a peer-reviewed academic journal that focuses on topics about libraries. The journal is abstracted and indexed in EBSCO databases.', 'title': 'In the Library with the Lead Pipe'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Teaching Mathematics and Its Applications is a triannual peer-reviewed academic journal in the field of mathematics education. The journal was established in 1982 and is published by Oxford University Press on behalf of the Institute of Mathematics and its Applications. The editors-in-chief are Duncan Lawson (Newman University, Birmingham), Chris Sangwin (Loughborough University, and Anne Watson University of Oxford. The journal is abstracted and indexed in the British Education Index, Education Research Abstracts, Educational Management Abstracts, Educational Technology Abstracts, MathEduc Database, and ProQuest databases.', 'title': 'Teaching Mathematics and Its Applications'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Aquaculture Research is a peer-reviewed academic journal on fisheries science and aquaculture published by John Wiley & Sons since 1970. The journal is abstracted and indexed in the Science Citation Index, Scopus, AGRICOLA, Biosis, Food Science & Technology Abstracts, Academic Search Premier, and Geobase. According to the "Journal Citation Reports", the journal has a 2014 impact factor of 1.376, ranking it 25th out of 52 journals in the category "Fisheries". Starting as "Fisheries Management" in 1970, the journal changed names in 1985 to "Aquaculture and Fisheries Management" and to "Aquaculture Research" in 1995.', 'title': 'Aquaculture Research'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Korean Journal of Sociology (Korean: Han\'guk Sahoehak, 한국사회학) is a peer reviewed academic journal on sociology that was established in 1964. It is the official journal of the Korean Sociological Association and covers theoretical developments, results of qualitative or quantitative research that advance our understanding of Korean society, and related subjects. The aim of the journal is to promote academic interaction and communication among sociologists in Korea and abroad. The editor in chief is In Hee Hahm (Ewha Womans University). The journal was published quarterly between 1964 and 2000, but since 2001 is published bimonthly, with issues in Korean published in February, April, August and October (issues 1, 2, 4, 5) and issues in English published biannually in June and December (issues 3 and 6). The journal is abstracted and indexed by CSA Illumina\'s "Sociological Abstracts" as a "core" journal.', 'title': 'Korean Journal of Sociology'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Journal of Entrepreneurial Finance is a biannual peer-reviewed open-access academic journal published by the Pepperdine University. It was established in 1991 as "The Journal of Small Business Finance". The journal covers topics related to finance, entrepreneurship, new ventures, and small business finance. It is abstracted and indexed in ProQuest databases, EconPapers, and RePEc. The editor-in-chief is Jim Brau (Brigham Young University)', 'title': 'The Journal of Entrepreneurial Finance'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Australian Literary Studies is a peer-reviewed academic journal of literary studies, specialising in historical, critical, and theoretical studies of Australian literature. It was established in 1963 by Laurie Hergenhan (University of Queensland), who edited the journal for its first forty years. It was then edited by Leigh Dale (University of Wollongong) from 2002 to 2015; in 2010 the journal increased its publication frequency to quarterly, with two issues (May and October) focussed on Australian authors and texts, along with two "general" issues (June and November). Successful special issues have focussed on queer writers and writing, the environment, medievalism, and biopolitics. Since 2016, the journal has been edited by Julieanne Lamond (Australian National University). In 2016, the journal ceased producing print volumes and digitised its entire archive. It also moved to a rolling publication model involving a mix of open access for new essays and low-cost subscription access to the archive. The journal, described as "the preeminent journal in Australian literary criticism", is abstracted and indexed by the MLA International Bibliography and AustLit.', 'title': 'Australian Literary Studies'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "EBSCO Information Services, headquartered in Ipswich, Massachusetts, is a division of EBSCO Industries Inc., the third largest private company in Birmingham, Alabama, with annual sales of nearly $2 billion according to the BBJ's 2013 Book of Lists. EBSCO offers library resources to customers in academic, medical, K–12, public library, law, corporate, and government markets. Its products include EBSCONET, a complete e-resource management system, and EBSCOhost, which supplies a fee-based online research service with 375 full-text databases, a collection of 600,000-plus ebooks, subject indexes, point-of-care medical references, and an array of historical digital archives. In 2010, EBSCO introduced its EBSCO Discovery Service (EDS) to institutions, which allows searches of a portfolio of journals and magazines.", 'title': 'EBSCO Information Services'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Rêve: the Dream Ouroboros is a French fantasy tabletop role-playing game created by Denis Gerfaud and re-published in English by Malcontent Games. It is the translation of Rêve de Dragon (English: "Dragon Dream" ), a best-selling game in France.', 'title': 'Rêve: the Dream Ouroboros'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The oral exam (also oral test or viva voce ; Rigorosum in German-speaking nations) is a practice in many schools and disciplines in which an examiner poses questions to the student in spoken form. The student has to answer the question in such a way as to demonstrate sufficient knowledge of the subject to pass the exam. The oral exam also helps reduce (although it does not eliminate) the risk of granting a degree to a candidate who has had the thesis or dissertation ghostwritten by an expert.', 'title': 'Oral exam'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Certificate of Primary Education is an academic qualification in Mauritius awarded upon the completion of primary school. The qualification is awarded upon earning passing marks on the primary school exams administered by the Mauritius Examinations Syndicate. Students who successfully earn the qualification may then progress onto secondary school study.', 'title': 'Certificate of Primary Education'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'D\'Alembert’s Dream ( or The Dream of D\'Alembert, French: Le Rêve de d\'Alembert ) is an ensemble of three philosophical dialogues authored by Denis Diderot in 1769, which first appeared in Grimm\'s "Correspondance Littéraire" in 1782, but was not published in its own right until 1830:', 'title': "D'Alembert’s Dream"}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Albert Viau (6 November 1910 – 27 June 2001) was a Canadian baritone, folksinger, composer, and music educator. After beginning his career as a musician in the classical repertoire, he specialized in folk music and traditional songs. He released about 50 78 rpm records during his career, mostly for La Bonne Chanson. He also recorded a few songs under the pseudonym Jacques Dupont, including "Partons, la mer est belle", "Le Soir sur l\'eau", and "Le Lac des amours", and recorded the song "Le Rêve passe" with the Canadian Grenadier Guards Band for RCA. Many of his recordings include his own compositions. During his lifetime he wrote more than 200 songs, many of them comic patter songs, as well as hymns and two requiem masses.', 'title': 'Albert Viau'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Léon Gastinel (August 15, 1823 – October 18, 1906) was a French composer. He studied at the Paris Conservatoire where he studied with Jacques Halévy and was awarded the Grand Prix de Rome in 1846 for his cantata "Valasquez". While relatively unknown today, Gastinel wrote two complete masses, two symphonies and four oratorios, and chamber music including at least two string sextets. He was most prolific however in his works for the stage which include the ballet "Le rêve" (1890, chor. Joseph Hansen, Paris Opera) and the operas "Le miroir" (1853), "L\'opéra aux fenêtres" (1857) and "Titus et Bérénice" (1860).', 'title': 'Léon Gastinel'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Gabriel\'s Dream (French: Le Rêve de Gabriel ) is a documentary film directed by Anne Lévy-Morelle. It tells the story of Gabriel de Halleux, an established businessman who, in late 1940s, decided to leave everything and start a new life in Chile Chico, in the depths of the Chilean Patagonia. In December 1997, "Gabriel\'s Dream" received the André Cavens Award for Best Film given by the Belgian Film Critics Association (UCC).', 'title': "Gabriel's Dream"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Dream (French: "Le Rêve", occasionally also known as "Le Songe" or "Rêve exotique") is a large oil-on-canvas painting created by Henri Rousseau in 1910, one of more than 25 Rousseau paintings with a jungle theme. His last completed work, it was first exhibited at the Salon des Indépendants from 18 March to 1 May 1910, a few months before his death on 2 September 1910. Rousseau\'s earlier works had received a negative reception, but poet and critic Guillaume Apollinaire remarked on its debut: "The picture radiates beauty, that is indisputable. I believe nobody will laugh this year."', 'title': 'The Dream (Rousseau painting)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Rico, 11, wakes up early to study for an exam. Today he has to pass the CPE, the exam that, in Mauritius, will get him into High school. He gets on the bus, but unfortunately, it breaks down. So he grabs a ride on a truck, but a fire brings traffic to a standstill. A neighbor offers to take him in his car. He’s on his way, but fate has other plans…', 'title': 'Le Rêve de Rico'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Hubert Haddad is a Tunisian poet, playwright, short story writer and novelist. He was born in Tunis in 1947. His debut collection of poems "Le Charnier déductif" appeared in 1967, and his first novel "Un rêve de glace" was published in 1974. Since then he has published numerous works in a wide range of literary forms.', 'title': 'Hubert Haddad'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Sze Yap Cantonese (Chinese: 四邑廣東人; Sze Yap: Hlei Yip Gong Ong Ngin; Cantonese: Sei Yap Gwong Dong Yan; Mandarin: Sìyì guǎngdōng rén) are a Han Chinese group coming from a region in Guangdong Province in China called Sze Yap (四邑), which consisted of the four county-level cities of Taishan, Kaiping, Xinhui, and Enping. Now Heshan has been added to this historic region, and the prefecture-level city of Jiangmen administers all five of these county-level cities, which is sometimes informally called Ng Yap. Their ancestors are said to have arrived from what is today central China about less than a thousand years ago and migrated into Guangdong around the Tang Dynasty rule period, and thus Taishanese as a dialect of Yue Chinese has linguistically preserved many characteristics of Middle Chinese.', 'title': 'Taishanese people'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Guzhang County () is a county of Hunan Province, China. The county is the 2nd least populous administrative unit of the counties or county-level cities (after Shaoshan City) in the province, it is under the administration of Xiangxi Autonomous Prefecture.', 'title': 'Guzhang County'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'According to the administrative divisions of China including Hong Kong and Macau, there are three level of cities, namely provincial-level (consists of municipalities and SARs), prefectural-level cities, and county-level cities. As of September 2017 the PRC has a total of 662 cities: 4 municipalities, 2 SARs, 293 prefectural-level cities (including the 15 sub-provincial cities) and 363 county-level cities (including the 9 sub-prefectural cities and 9 XXPC cities) not including any cities in the claimed province of Taiwan.', 'title': 'List of cities in China'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Yixing () is a county-level city with a population of 1.24 million administrated under the prefecture-level city of Wuxi in southern Jiangsu province, People's Republic of China, and is part of the Yangtze River Delta. The city is known for its traditional Yixing clay ware.", 'title': 'Yixing'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Shuangpai County () is a county in Hunan Province, China, it is under the administration of Yongzhou Prefecture-level City. Shuangpai is also the 3rd smallest administrative unit (after Shaoshan and Guzhang) by population in the counties and county-level cities of the province.', 'title': 'Shuangpai County'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Yixing clay () is a type of clay from the region near the city of Yixing in Jiangsu Province, China, used in Chinese pottery since the Song dynasty (960–1279) when Yixing clay was first mined around China's Lake Tai. From the 17th century on, Yixing wares were commonly exported to Europe. The finished stoneware, which is used for teaware and other small items, is usually red or brown in color. Also known as zisha () ware, they are typically left unglazed and use clays that are very cohesive and can form coils, slabs and most commonly slip casts. These clays can also be formed by throwing. The best known wares made from Yixing clay are Yixing clay teapots, tea pets, and other teaware.", 'title': 'Yixing ware'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Yixing Pumped Storage Power Station is a pumped-storage hydroelectric power station located Yixing city of Jiangsu Province, China. Construction on the power station began in 2003 and the first unit was commissioned in 2007, the last in 2008. The entire project cost US$490\xa0million, of which US$145\xa0million was provided by the World Bank. The power station operates by shifting water between an upper and lower reservoir to generate electricity. The lower reservoir was formed with the existing Huiwu Dam at the foot of Mount Tongguan. The Yixing Upper Reservoir is located atop Mount Tongguan which peaks at 530 m above sea level. During periods of low energy demand, such as at night, water is pumped from Huiwu Lower Reservoir up to the upper reservoir. When energy demand is high, the water is released back down to the lower reservoir but the pump turbines that pumped the water up now reverse mode and serve as generators to produce electricity. Water from the nearby Huangtong River can also be pumped into the lower reservoir to augment storage. The process is repeated as necessary and the plant serves as a peaking power plant. The power station is operated by East China Yixing Pumped Storage Co Ltd.', 'title': 'Yixing Pumped Storage Power Station'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Shaoshan () is a county-level city in Hunan Province, China. It is under the administration of Xiangtan prefecture-level City. Qingxi Town is its seat.', 'title': 'Shaoshan'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'A tea pet, also known as a tea lover\'s pet, is a small clay figure which is kept by some tea drinkers for good luck. The history of tea pets can be traced back to the Yuan dynasty (1206–1368). They are usually made of "zisha" or Yixing clay, from the region near Yixing in Jiangsu province, China. Just like Yixing teapots made of the same clay, tea pets are unglazed, so that they are mostly monochromatic with a rough surface. Tea lovers in China raise a tea pet by placing it on the tea tray during tea time and pouring out the tea over it. The most popular figure of the tea pet is the "pee-pee boy", which is used to judge whether the water is hot enough to make tea. Tea pets are also molded into zodiac animals or Chinese mythical creatures such as dragons, Pixiu, Qilin, etc., to symbolize good luck, fortune and happiness, as well as historical or mythical characters such as Guanyin, Maitreya and Zhu Geliang.', 'title': 'Tea pet'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Former Residence of Mao Zedong or Mao Zedong's Former Residence () was built in the late Qing Dynasty. It is located in Shaoshan Village of Shaoshan township in Shaoshan, Xiangtan, Hunan, China. The building was the birthplace and childhood home of Mao Zedong, the first leader of the People's Republic of China. It has a building area of about 472.92 m2 , embodies buildings such as the old houses, the Mao Zedong Memorial Hall, the Bronze Statue of Mao Zedong, the Cultural relics Exhibition Hall, and the Dishui Hole (Dripping Water Cave; 滴水洞 ).", 'title': "Mao Zedong's Former Residence"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Gopishantha (26 May 1937 – 10 October 2015), better known by her stage name Manorama, also called as Aachi, was an Indian actress and comedian who had appeared in more than 1,500 films, 5,000 stage performances, and several television series until 2015. She entered the "Guinness World Records" for acting in more than 1000 number of films in 1985. By 2015, she had acted in more than 1,500 films. She was a recipient of the Kalaimamani award, Padma Shri (2002), National Film Award for Best Supporting Actress for her performance in film "Pudhiya Padhai" (1989), and Filmfare Lifetime Achievement Award – South (1995).', 'title': 'Manorama (Tamil actress)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Woody Guthrie Folk Festival is held annually in mid-July to commemorate the life and music of Woody Guthrie. The festival is held on the weekend closest to July 14 - the date of Guthrie's birth - in Guthrie's hometown of Okemah, Oklahoma. Daytime main stage performances are held indoors at the Brick Street Cafe and the Crystal Theater. Evening main stage performances are held outdoors at the Pastures of Plenty. The festival is planned and implemented annually by the Woody Guthrie Coalition, a non-profit corporation, whose goal is simply to ensure Guthrie's musical legacy.", 'title': 'Woody Guthrie Folk Festival'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'South of the Border is a 2009 American documentary film directed by Oliver Stone. The documentary premiered at the 2009 Venice Film Festival. Writer for the project Tariq Ali calls the documentary "a political road movie". Stone stated that he hopes the film will help people better understand a leader who is wrongly ridiculed "as a strongman, as a buffoon, as a clown."', 'title': 'South of the Border (2009 film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Margaretha Murray (stage name Milan Murray) (30 October 1974) is a South African actress. She is most well known to the South African public for roles in various soap operas, but she has also played and starred in feature films, and regularly does stage performances. In addition she co-anchors "Ontbytsake", a weekly Breakfast show on kykNET, an Afrikaans channel on DStv. She lives in Johannesburg with her husband, Schalk van der Merwe, her son Steph and daughter Lua. She was raised in the Cape Province, South Africa.', 'title': 'Milan Murray'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Sine Novela is a Philippine daytime soap opera aired on GMA Network which showcases old classic movies from Viva Films turned into a mini-series. The show was stars and lead into an ensemble cast.', 'title': 'Sine Novela'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Leah Flanagan is a singer-songwriter from Sydney, NSW. Leah has appeared on Australian TV shows Spicks & Specks and RockQuiz, has released 2 albums and toured extensively through Australia with her music and part of festival ensembles. Leah’s status as an Indigenous musician is one of pride and respect; she has helped make history with such recent essential albums as Archie Roach’s 25th anniversary reissue of Charcoal Lane and Buried Country 1.5, The Story of Aboriginal Country Music. Her latest album Saudades was recorded at the studio of Midnight Oil's Jim Moginie and mixed by Paul McKercher (You Am I, Augie March)", 'title': 'Leah Flanagan'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Buried Country is a highly regarded documentary film, book and soundtrack album and now also a stageshow as well. It is a prosopography, created by noted writer Clinton Walker, that tells the story of Australian country music in the Aboriginal community by focussing on the genre's most important stars.", 'title': 'Buried Country'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Araby Lockhart (born December 4, 1926) is a Canadian stage and television actress, best known for her performances in the films "Capote" and "Police Academy" and her stage performances as a member of Hart House Theatre and the Straw Hat Players. Lockhart has also served as President of the Actors\' Fund of Canada.', 'title': 'Araby Lockhart'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Edward John Carroll (1874-1931), better known as E.J. Carroll, was an Australian theatre and film entrepreneur. He produced several films of Snowy Baker and Raymond Longford and helped establish Birch, Carroll and Coyle. Difficulties in securing international distribution for his films turned him away from production towards exhibition.', 'title': 'E. J. Carroll'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Clinton Walker (born 1957) is an Australian writer, best known for his works on popular music but with a broader interest in social and cultural history and theory. Sydney\'s "Sun-Herald" has called him "our best chronicler of Australian grass-roots culture." He has always been ahead of the curve. As "Rhythms" magazine said in 2015, "Like many of Walker’s projects, "Buried Country" was at least a decade ahead of its time," and as such he is remarkable as a critic who has exerted a pro-active impact on Australian music and its development; groundbreaking books like "Inner City Sound" (1981) and "Buried Country" (2000) especially have informed and inspired successive generations of musicians. Similarly, while he found best-selling success as Bon Scott\'s biographer, Walker\'s non-music books like "Football Life" (1998) and "Golden Miles" (2005) have innovatively offered an appreciation of subjects hitherto hardly deemed worthy of serious consideration.', 'title': 'Clinton Walker'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Stony Brook University School of Medicine is the medical school of Stony Brook University. The school is located in the Stony Brook University Hospital located at Stony Brook, NY.', 'title': 'Stony Brook University School of Medicine'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The State University of New York at Stony Brook (also known as Stony Brook University or SUNY Stony Brook) is a public sea-grant and space-grant research university located in Stony Brook, New York in the United States. It is part of the State University of New York (SUNY) system.', 'title': 'Stony Brook University'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The Stony Brook University Track is the track/field at Stony Brook University serving as the home of the Stony Brook Seawolves men's and women's Track & Field Division I program. The Track and Field is located in the west campus and limited to the east by the Kenneth P. LaValle Stadium, to the west by Circle Road, to the south by Stony Brook Sports Complex and the recreational basketball and handball courts, and limited to the north by the intramural baseball and soccer fields.", 'title': 'Stony Brook University Track'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Joe Nathan Field is a baseball field on the campus of Stony Brook University in Stony Brook, New York, United States. It is also referred to as the Stony Brook Baseball Field. The field is home to the team of the NCAA Division I America East Conference. It is located at the northern end of the school's athletics complex. The facility was known as Seawolves Field through the 2002 season, when its name was changed to University Field. In 2011, the stadium was rededicated for then-Minnesota Twins pitcher and Stony Brook alumnus Joe Nathan after Nathan's $500,000 gift made extensive renovations possible. As part of the renovations, a FieldTurf surface was installed.", 'title': 'Joe Nathan Field'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Pritchard Gymnasium is a 2,000-seat multi-purpose gymnasium located within the Stony Brook Sports Complex in Stony Brook, New York. The gym opened in 1969 and was the home of the Stony Brook University Patriots/Seawolves basketball and volleyball teams, as well as the venue for a multitude of concerts, including big names such as Janice Joplin with Big Brother and the Holding Company. The Island Federal Credit Union Arena completed its renovation project in 2014. It also served as the only home of the Seawolves prior to the IFCU Arena's opening in 1990. Pritcard gymnasium was renovated in the summer of 2008 and reopened in time for the 2009 Stony Brook Women's Volleyball season. The new gym features a refinished hardwood floor with a painting of Wolfie, a new large scoreboard, and retractable bleachers.", 'title': 'Pritchard Gymnasium'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Stony Brook University Hospital, previously known as Stony Brook University Medical Center, is the university hospital of Stony Brook University located in the East Campus in Stony Brook, New York. It is the largest academic medical center on Long Island with 603 beds for patient care. The hospital houses the Stony Brook University School of Medicine. Long Island's only tertiary care and Level 1 Trauma Center, the hospital is ranked as the 20th best in New York and 21st in the New York metropolitan area by U.S. News and World Report", 'title': 'Stony Brook University Hospital'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Chuck Priore is the current head coach of the Stony Brook Seawolves football team, which represents Stony Brook University in the NCAA, and participates in the Colonial Athletic Association. Priore was hired prior to the 2006 season and he led the transition of Stony Brook into a full-scholarship FCS program from the 2006 season in which the team awarded an equivalent 27 scholarships. In 2007, the team played as an independent while adding scholarships and a tougher schedule. In 2008, Stony Brook joined the Big South Conference as a full-scholarship program. Priore led the Seawolves to three consecutive Big South championships (in 2009, 2010, 2011) and so far has compiled a 37-31 record. Under the leadership of Priore the Seawolves played their first ever FBS opponent, South Florida, in the 2010 season. In 2011, Stony Brook won their first outright Big South Championship and participated for the first time in the FCS playoffs, advancing to the Second Round.', 'title': 'Stony Brook Seawolves football under Chuck Priore'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "The University of New Hampshire (UNH) is a public research university in the University System of New Hampshire, in the United States. The university's Durham campus, comprising six colleges, is located in the Seacoast region of the state. A seventh college, the University of New Hampshire at Manchester, occupies the university's campus in Manchester, the state's largest city. The University of New Hampshire School of Law, known as the Franklin Pierce Law Center until 2010, is located in Concord, the state's capital.", 'title': 'University of New Hampshire'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Stony Brook Sports Complex is a multi-purpose complex located in Stony Brook University, Stony Brook, NY. The Complex houses the Stony Brook Arena on the west end, the Pritchard Gymnasium, a 25 yard long swimming Pool, an athletic performance center and many other athletic facilities within. Currently, the Stony Brook Seawolves basketball and volleyball programs home games are played in the Complex, specifically in the Pritchard Gymnasium. The Stony Brook Arena on the west end is currently undergoing $20 million renovation. During this renovation period, the Pritchard Gymnasium will be used to host the basketball and volleyball games.', 'title': 'Stony Brook Sports Complex'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The State University of New York at Stony Brook is the largest residential campus in the SUNY system, with approximately 54.5% of its students living on campus. Housing at Stony Brook is issued and controlled by Stony Brook University Campus Residences, which provides 9,445 spaces in its 11 corridor style buildings, 17 suite style buildings, and 23 apartment style buildings to Undergraduate students, Graduate students, and student's families. The large majority of on-campus housing is provided to students on the university's west campus, but housing is available to those on east campus, and for Stony Brook Southampton students.", 'title': 'Stony Brook University student housing'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'TOCA Race Driver (DTM Race Driver in Germany, Pro Race Driver in North America and V8 Supercar: Race Driver in Australia) is a racing video game developed and published by Codemasters for PlayStation 2, Microsoft Windows and Xbox. It is the fourth game in the "TOCA" series.', 'title': 'TOCA Race Driver'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Ferrari 126C was the car with which Ferrari raced in the 1981 Formula One season. The team's first attempt at a turbo engined Formula 1 car, it was designed by Mauro Forghieri and Harvey Postlethwaite and used between the 1981 and 1984 seasons.", 'title': 'Ferrari 126C'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The 1958 United States Grand Prix for Sports Cars was a sports car race held at Riverside International Raceway on October 12, 1958. It was the fourth and final round of the 1958 USAC Road Racing Championship season, the seventeenth round of the Sports Car Club of America's Pacific Coast Championship, the second running of the Riverside Grand Prix, and the first post-World War II running of the United States Grand Prix. The race was held over 62 laps of Riverside's 3.3 mi circuit, for a total of 203.1 mi . Chuck Daigh won the race overall, driving one of Lance Reventlow's Scarab-Chevrolets. The race is also noteworthy in the annals of international racing, as the strong second-place finish by a local driver named Dan Gurney earned him a test drive in a factory Ferrari Formula 1 car, effectively launching the Californian's legendary racing career.", 'title': '1958 United States Grand Prix for Sports Cars'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The New Hampshire Indy 225 was an IndyCar race at the New Hampshire Motor Speedway in Loudon, New Hampshire. It was held as a CART Champ Car event from 1992 until 1995, switching to the Indy Racing League for the 1996–97 season. On June 21, 2010, it was announced that the IndyCar Series would return to New Hampshire for the 2011 season. When the IndyCar Series returned to New Hampshire Motor Speedway the race was scheduled to be 225 laps. A Firestone Indy Lights and NASCAR Whelen Modified Tour race accompanied the feature. The race did not return for the 2012 IndyCar Series season.', 'title': 'New Hampshire Indy 225'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Robert Józef Kubica (; born 7 December 1984) is a Polish current rally and former Formula 1 racing driver. He became the first Polish driver to compete in Formula One. Between 2006 and 2009 he drove for the BMW Sauber F1 team, promoted from test driver to race driver during 2006. In June 2008, Kubica took his maiden Formula One victory in the Canadian Grand Prix, becoming the first Polish driver to win a Formula One race.', 'title': 'Robert Kubica'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'TOCA Race Driver 3 (DTM Race Driver 3 in Germany, V8 Supercars 3 in Australia, TOCA Race Driver 3 Challenge in the PlayStation Portable version and Race Driver: Create & Race in the Nintendo DS version) is a Racing video game developed and published by Codemasters for Microsoft Windows, PlayStation 2, Xbox, PlayStation Portable, Nintendo DS and OS X. It is the sixth game in the "TOCA" series. The game features several fully licensed championships, including the DTM series and V8 Supercar championship. This is the last in the series to have TOCA in its title as following on from this TOCA was dropped in favour of just Race Driver.', 'title': 'TOCA Race Driver 3'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Ricardo Teixeira (born 2 August 1984 in Lisbon, Portugal) is a Portuguese-Angolan racing driver. He holds dual nationality and has raced under both nationalities at various points in his career. He was the first Angolan driver to drive a Formula 1 car when he was announced as a test driver for Team Lotus for 2011. He has been sponsored throughout his career by the Angolan oil company Sonangol.', 'title': 'Ricardo Teixeira (racing driver)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The 2012 MAVTV 500 IndyCar World Championships was the 15th and final race of the 2012 IndyCar Series season. The event took place on September 15, at the 2.000 mi Auto Club Speedway in Fontana, California. It was the first IndyCar race at this facility since 2005, the first 500-mile open-wheel race outside Indianapolis since the CART-sanctioned 2002 The 500 at Fontana, and the first 500-mile IndyCar Series race outside Indianapolis.', 'title': '2012 MAVTV 500 IndyCar World Championships'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "The Super Aguri F1 SA07 was Super Aguri F1's Formula One car for the 2007 Formula One season. It was designed by Peter McCool and was driven by Takuma Sato and Anthony Davidson.", 'title': 'Super Aguri SA07'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Takuma Sato (佐藤 琢磨 , Satō Takuma , born 28 January 1977) is a Japanese professional racing driver. He competed in Formula One from 2002 to 2008 for the Jordan, BAR and Super Aguri teams, scoring a single podium at the 2004 United States Grand Prix. Sato has raced full-time in the IndyCar Series since 2010 for the KV, Rahal, Foyt, and currently Andretti teams. Sato won the 2013 Toyota Grand Prix of Long Beach, becoming the first Japanese driver to win an IndyCar race. He is also the first Asian driver to win the Indianapolis 500, having won the 2017 edition.', 'title': 'Takuma Sato'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Jiroemon Kimura (木村 次郎右衛門 , Kimura Jirōemon , April 19, 1897 – June 12, 2013) was a Japanese supercentenarian. He became the oldest verified male in history on December 28, 2012, at the age of 115 years and 253 days when he surpassed the age of Christian Mortensen who died in 1998, and also became the first and so far the only man who indisputably reached 116 years of age, being 116 years, 54 days old at the time of his death from natural causes on June 12, 2013, in a hospital in his hometown of Kyōtango, Kyoto Prefecture, Japan. He was the last known living man born in the 19th century.', 'title': 'Jiroemon Kimura'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'GetBackers (Japanese: ゲットバッカーズ -奪還屋- , Hepburn: Gettobakkāzu Dakkan\'ya , lit. "GetBackers: Recovery Service") is a Japanese manga series written by Yuya Aoki and illustrated by Rando Ayamine. The series was serialized and is published by Kodansha\'s "Weekly Shōnen Magazine" from 1999 until 2007, totaling 39 volumes. The plot follows the "GetBackers", a group that retrieves anything that was lost. The team is primarily composed of Ban Mido, a man born with the illusionary technique "Evil Eye", and Ginji Amano the former leader of a gang called "The VOLTS", a powerful group in the dangerous territory called the Infinity Fortress in Shinjuku.', 'title': 'GetBackers'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Cagliostro-Walzer op.370 is a waltz by Johann Strauss II composed in 1875 based on themes from his operetta, Cagliostro in Wien which premiered on 27 February 1875 at the famous Theater an der Wien.', 'title': 'Cagliostro-Walzer'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Johann Strauss II (October 25, 1825 – June 3, 1899), also known as Johann Strauss Jr., the Younger, the Son (German: "Sohn" ), Johann Baptist Strauss, was an Austrian composer of light music, particularly dance music and operettas. He composed over 500 waltzes, polkas, quadrilles, and other types of dance music, as well as several operettas and a ballet. In his lifetime, he was known as "The Waltz King", and was largely then responsible for the popularity of the waltz in Vienna during the 19th century.', 'title': 'Johann Strauss II'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Claude Stanley Choules ( ; 3 March 1901 – 5 May 2011) was an English-born military serviceman from Perth, Australia who at the time of this death was the oldest combat veteran of the First World War from England, having served with the Royal Navy from 1915 until 1926, after having emigrated to Australia he served with the Australian Royal Navy, from 1926 until 1956, as a Chief Petty Officer and was a naturalised Australian citizen. He was the last surviving military witness to the scuttling of the German fleet in Scapa Flow in 1919. He was also the last surviving veteran to have served in both world wars, at the time of his death, he was also the third-oldest verified military veteran in the world and the oldest known living man in Australia. He was the seventh-oldest living man in the world. Choules became the oldest man born in the United Kingdom following the death of Stanley Lucas on 21 June 2010. Choules died in at the age of 110 years and 63 days. He had been the oldest British-born man; following his death, that honour went to Reverend Reginald Dean. In December 2011, the landing ship HMAS\xa0"Choules" was named after him, only the second Royal Australian Navy vessel named after a sailor.', 'title': 'Claude Choules'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Gbadamosi Adegoke Adelabu (3 September 1915 – 25 March 1958) was a prominent personality in the politics of Ibadan city and subsequently that of the Western Region of Nigeria right before the country's independence in 1960. He was Nigeria's Minister of Natural Resources and Social Services from January 1955 to January 1956 and was later the opposition leader in the Western Regional Assembly until his death in 1958. He was a self-made man born into a humble family but became an influential figure in Nigerian politics. He attended Government College, Ibadan and eventually became a business man. His successful political career was cut short when he was killed in a car crash, not long before Nigeria gained independence from Britain.", 'title': 'Adegoke Adelabu'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'James Emmanuel "Doc" Sisnett (22 February 1900 – 23 May 2013) was a Barbadian supercentenarian. Born and raised in Saint George, he spent his life as a blacksmith, sugar factory worker, and farmer, not retiring from the latter until he turned 100. In excellent health throughout his life, he died at the age of 113 years, 90 days and held a number of distinctions. Among them, he was the verified oldest man in the Western Hemisphere, the second-oldest man in the world, and the last surviving black man born in the 19th century. He was also the only verified supercentenarian from Barbados and, along with Jiroemon Kimura (who died 20 days after Sisnett), one of the last men born in the 19th century.', 'title': 'James Sisnett'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The episodes for the anime series "GetBackers" were produced by Studio Deen and based on the manga series of the same name written by Yuya Aoki and illustrated by Rando Ayamine. The series premiered on Tokyo Broadcasting System in Japan on October 5, 2002 and ran for forty-nine episodes until September 20, 2003 under direction of Kazuhiro Furuhashi and Keitaro Motonaga. The plot follows the "GetBackers", a group that retrieves anything that was lost. The team is primary composed by Ban Mido, a man born with the illusionary technique "Evil Eye", and Ginji Amano the former leader of a gang called "The VOLTS", a powerful group in the dangerous territory called the Limitless Fortress in Shinjuku.', 'title': 'List of GetBackers episodes'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The World According to Garp is John Irving's fourth novel, about a man born out of wedlock to a feminist leader who grows up to be a writer. Published in 1978, the book was a bestseller for several years. It was a finalist for the National Book Award for Fiction in 1979, and its first paperback edition won the Award the following year.", 'title': 'The World According to Garp'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The compositions of Sergei Rachmaninoff (1873–1943) cover a variety of musical forms and genres. Born in Russia, he studied at the Moscow Conservatory with Nikolai Zverev and Anton Arensky, and while there, composed some of his most famous works, including the first piano concerto (Op. 1) and the Prelude in C-sharp minor (Op. 3, No. 2). Although spread over three different opuses, he did go on to complete an important set of 24 preludes in all the major and minor keys. His Symphony No. 1 (Op. 13) was one of his first compositions as a "Free Artist" after graduation, and subsequently his first critical failure. The derision he received sent him into depression. After being sent through autosuggestive therapy, he composed his second piano concerto (Op. 18), which is still part of the major orchestra repertoire today. In 1909, he made his first tour of the United States, and composed Piano Concerto No. 3 (Op. 30), notable for its difficult cadenza. After this, due to migration from Russia in 1917 and his busy concert career, his output as a composer decreased, and during this period, he completed only six compositions. His last work, "Symphonic Dances" (Op. 45), was completed in 1940.', 'title': 'List of compositions by Sergei Rachmaninoff'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Live from Abbey Road is a 12-part, one-hour performance series/documentary that began filming its first season during 2006 at Abbey Road Studios in London. Season 2 was filmed between 2007 and 2008, season 3 was filmed in 2009 and Season 4 was filmed in 2011. The series features a total of 128 musical artists to date (about 32 per Season) -- usually two or three per show, performing up to five songs per session. The sessions are recorded without a live audience. Filmed in High-Definition with the occasional use of 35 mm lenses, the producers have sought to record performances which "look like a movie and sound like a record".', 'title': 'Live from Abbey Road'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Rose Marie is a 1954 musical adaptation of the 1924 operetta of the same name, the third to be filmed by Metro-Goldwyn-Mayer, following a 1928 silent movie and the best-known of the three, the 1936 Jeanette MacDonald/Nelson Eddy version. It is directed by Mervyn LeRoy and stars Ann Blyth, Howard Keel and Fernando Lamas. This version is filmed in the Canadian Rockies in CinemaScope. It was MGM's first US produced film in the new widescreen medium (having been preceded by the British made Knights of the Round Table) and the first movie musical of any studio to be released in this format.", 'title': 'Rose Marie (1954 film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Pin Up Girls are a girl group and dance troupe, founded by New York City native Vixen Romeo in 2005, which began as a burlesque-style performance group based in Los Angeles. Performing at Hollywood\'s most notorious venues such as The Viper Room Key Club and Roxy the girls quickly gained local attention with their girl-on-girl themed, tribal fusion belly dance, burlesque and hip hop routines. Between 2006-2008 The Pin Up Girls started to become poster girls for the lesbian scene with performances for Curve (magazine), a guest appearance on LOGO network\'s reality series "Curl Girls", a web series segment on AfterEllen, a performance for the LGBT community hosted by Jane Lynch, and performances in Margaret Cho\'s Sensuous Woman Show. In 2008 The Pin Up Girls first recorded single "There She Goes...She\'s Real Fly" was picked up to be played on Showtime\'s hit lesbian series "The L Word". In 2009 The Pin Up Girls music video, "There She Goes...She\'s Real Fly" premiered on Logo (TV channel) (an MTV network), on New Now Next Pop Lab. The Pin Up Girls\' "Girl Candy," filmed in N.Y. and L.A., was released in 2011. The Pin Up Girls\' "Pretty Things", featuring actress Elaine Hendrix, was filmed in L.A. by Director Joe LaRue in 2012 and was released in June 2012.', 'title': 'The Pin Up Girls'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Asturian Cinema (or "Asturian National Cinema") in Asturias, Spain, began in 1905 with the production of the first Asturian fiction film known as "El robo de fruta" (The fruit robbery). It was filmed by the Asturian film maker Javier Sánchez Manteola. This movie was filmed in Gijón (Asturias) and premiered in that city in the same year. It was shown in the old movie theater known as Salón Luminoso once located at Begoña Walk. In commemoration of this even the Asturian Film Festival was established in the year 2005.', 'title': 'Asturian cinema'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Live from Daryl\'s House (simply known as Daryl\'s House, and often abbreviated as LFDH) is an online series that was first created in fall 2007. The show features singer-songwriter Daryl Hall performing with his band and various guest artists at his home in Millerton, New York. The show provides a performance space that is an alternative to live concerts and studio sessions for popular artists. This allows the artists to "…have fun and [be] creatively spontaneous". The majority of shows include a segment in which Hall and the guest artist prepare food from different cuisines for everyone to eat. The food comes from various local restaurants and the chefs of those establishments walk Hall and guest through the preparation of the food. "Live From Daryl\'s House" expanded to broadcast TV but remained unchanged. Hall was quoted by Billboard.com as saying "it\'s an Internet show that is being shown on television, so I\'m not adapting the show at all in any way to be a \'TV\' show." The show debuted in 95 markets on September 24, 2011, with back-to-back half-hour episodes featuring Train (Episode 33) and Fitz & the Tantrums (Episode 35). Starting with the 66th episode of "Live From Daryl\'s House", the shows are filmed at Hall\'s club, Daryl\'s House, in Pawling, New York.', 'title': "Live from Daryl's House"}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The Guest is a 2014 American action horror-thriller film directed and edited by Adam Wingard and written by Simon Barrett, both of whom previously collaborated on a previous film, "You\'re Next" (2011). Starring Dan Stevens, Maika Monroe, Leland Orser, Sheila Kelley, Brendan Meyer, and Lance Reddick, the plot follows a soldier named "David" unexpectedly visiting the Peterson family, introducing himself as a friend of their son who had died during the Afghanistan war. After the man is welcomed into their home for a couple of days, a series of deaths begin to occur around his presence, and their daughter Anna begins to have suspicions of David being connected to the deaths.', 'title': 'The Guest (film)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "You're Next is a 2011 American slasher film directed by Adam Wingard, written by Simon Barrett and starring Sharni Vinson, Nicholas Tucci, Wendy Glenn, A. J. Bowen and Joe Swanberg. The plot concerns a family under attack by a group of masked assailants during their wedding anniversary getaway.", 'title': "You're Next"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The White Hell of Pitz Palu (German: "Die weisse Hölle vom Piz Palü" ) is a 1929 German silent mountain film co-directed by Arnold Fanck and Georg Wilhelm Pabst and starring Leni Riefenstahl, Gustav Diessl, Ernst Petersen, and World War I flying ace Ernst Udet. Written by Arnold Fanck and Ladislaus Vajda, the film is about a man who loses his wife in an avalanche while climbing the Piz Palü mountain, and spends the next few years searching the mountain alone for her body. Four years later he meets a young couple who agree to accompany him on his next climb. "The White Hell of Pitz Palu" was filmed on location in the Bernina Range in Graubünden, Switzerland. The 1929 theatrical release starred Kurt Gerron, who was Jewish, as a night club guest. The film was edited to remove scenes featuring Gerron, and it was rereleased as a 90-minute German-language sound film in 1935. It was remade in 1950.', 'title': 'The White Hell of Pitz Palu'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'K. Ravindran Nair was born in a rich family, dealing with cashew production and exports. His passion for literature and arts brought him into Malayalam cinema and in 1967, he established "General Pictures" under the banner of which he produced his first movie, Anweshichu Kandethiyilla, directed by P. Bhaskaran. This was followed by two more films the next year, Kattukurangu and Lakshaprabhu, both directed by Bhaskaran. Ravi, as he is generally known, was silent for the next few years till he came out with his next film, Achani, an A. Vincent movie, in 1973, which earned him the moniker, "Achani Ravi". The film was reported to be a commercial success like his earlier films and Ravi is known to have contributed the returns from the movie for building a Public Library in Kollam, of which he is a founder member and honorary secretary.', 'title': 'K. Ravindran Nair'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Stephen Nicholas (born 23 August 1978) also known as Stephen Charles Nicholas is an actor and presenter from Doncaster, South Yorkshire, England. Stephen currently lives in Sheffield, his first role was on Sky One's Dream Team, where he played Scott Ward. From there, he filmed the first in the trilogy Goal! (In which he played a Newcastle United Reserves player). Following this, he moved to Los Angeles, where he played Smith in the feature film Futbaal: The Price of Dreams. Stephen then returned to the UK to make a Bollywood film called Dhana Dhana Goal with John Abraham. Stephen then experienced his first opportunity in reality TV with the show Premier League All Stars for Sky One, as well as playing a footballer, he was on-hand to present celebrity gossip and pitch side reports. He then appeared in Celebrity Most Haunted and Date the Enemy. From there he then went on to star in Goal 3 where he not only acted in the film he also became the football choreographer and choreographed all the football scenes in the film. Nicholas then starred in the film Damned United where he played Welsh international Alan Durban, the film was filmed in Chesterfield and Leeds and was directed by Oscar winner Tom Hooper and also starred Oscar nominated Michael Sheen. Stephens next production was the feature film called 'No Way Back Now'about the notorious Manchester district of Moss Side, where Stephen played the lead actor Stuart Gavin,The feature is roughly based on the notorious Gooch gang that terrorised Manchester throughout the years. The next move for Stephen was pantomime where he was part of the production Aladdin over the Christmas period of 2015 in Doncaster playing Abanaza the main villain which he did until January 7, 2016! . He has recently been cast in the up-and-coming Feature Film 'Whiteblade' where he will play Thurstan the head Warlord Whiteblade is currently in production and Stephen is shooting his scenes in August 2016. In September 2016 Stephen will be presenting the Sky TV show 'Britz go Bollywood' the show consists of a group of Celebrities being dressed by The best Indian designers, Stephen is the main presenter of the show which will be screened live September 2, 2016.", 'title': 'Stephen Nicholas (actor)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Lieutenant-General Sir Andrew Agnew, 5th Baronet JP (21 December 1687 – 14 August 1771) was the son of Sir James Agnew, 4th Baronet and Lady Mary Montgomerie.', 'title': 'Sir Andrew Agnew, 5th Baronet'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Skelmorlie Castle stands on the eastern shore of the Firth of Clyde, Scotland, at the north-western corner of the county of Ayrshire. The structure dates from 1502, and was formerly the seat and stronghold of the Montgomery Clan. The modern village of Skelmorlie lies to the north of the castle.', 'title': 'Skelmorlie Castle'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Sir John Walter Buchanan-Riddell, 11th Baronet (14 March 1849 – 31 October 1924) was a British barrister and baronet. He was educated at Eton College and Christ Church, Oxford before being called to the bar (becoming a barrister) by Inner Temple in 1874. He succeeded his uncle (Sir Walter Riddell, 10th Baronet) as 11th Baronet in the line of Riddell Baronets in 1892. In 1897, he served as High Sheriff of Northumberland. He was a member of the Council of Keble College, Oxford from 1899 until his death. He died on 31 October 1924, succeeded by his son, Sir Walter Robert Buchanan-Riddell, 12th Baronet, who was Principal of Hertford College, Oxford.', 'title': 'Sir John Buchanan-Riddell, 11th Baronet'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Sir James Steuart, 3rd Baronet of Goodtrees and eventually 7th Baronet of Coltness; late in life Sir James Steuart Denham, also called Sir James Denham Steuart ( ; 21 October 1713, Edinburgh – 26 November 1780, Coltness, Lanarkshire) was a prominent Scottish Jacobite and author of "probably the first systematic treatise written in English about economics" and the first book in English with \'political economy\' in the title. He assumed the surname of Denham late in life; he inherited his cousin\'s baronetcy of Coltness in 1773.', 'title': 'James Steuart (economist)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "The Borrowes Baronetcy of Grangemellon in the County of Kildare, was a title in the Baronetage of Ireland. It was created on 14 February 1646 for Erasmus Borrowes, High Sheriff of Kildare in 1641. Sir Kildare Borrowes, 3rd Baronet was twice High Sheriff of Kildare and a member of the Irish Parliament for Kildare County. His son Sir Walter Borrowes, 4th Baronet represented Harristown and Athy in the Irish Parliament. The latter's son Sir Kildare Borrowes, 5th Baronet represented Kildare County and was High Sheriff of Kildare in 1751. Sir Erasmus Dixon Borrowes, 9th Baronet was High Sheriff of Kildare in 1873 and High Sheriff of Queen's County in 1880. The baronetcy became extinct on the death of the 11th baronet in 1939.", 'title': 'Borrowes baronets'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Sir James Hall of Dunglass, 4th Baronet FRS FRSE (17 January 1761 – 23 June 1832) was a Scottish geologist and geophysicist, born at Dunglass, East Lothian, to Sir John Hall, 3rd Baronet (died 1776), by his spouse, Magdalen (died 1763) daughter of Sir Robert Pringle, 3rd Baronet, of Stichill, Roxburghshire. Sir James was also Member of Parliament for St. Michael's borough (Mitchell, Cornwall) 1807–1812.", 'title': 'Sir James Hall, 4th Baronet'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Charlwood Lawton (1660–1721) was an English lawyer and phrase-making pamphleteer, a Whig of Jacobite views. He invented the term "Whiggish Jacobite", used to point out the difference between those who shared his opinions (who included Sir James Montgomery, 4th Baronet and Robert Ferguson), and the nonjuror faction. After the Battle of La Hogue of 1692, the exiled James II of England became more receptive to Lawton\'s range of arguments. Lawton promoted "civil comprehension", i.e. the removal of all religious tests for the holding of public office. He was a prolific author of subversive literature, to whom some uncertain attributions are made. He is credited with the concept that the Glorious Revolution was a constitutional charade that fell short of its ideals.', 'title': 'Charlwood Lawton'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Baron Brownlow, of Belton in the County of Lincoln, is a title in the Peerage of Great Britain. It was created in 1776 for Sir Brownlow Cust, 4th Baronet. The Cust family descends from Richard Cust who represented Lincolnshire and Stamford in Parliament. In 1677 he was created a baronet, of Stamford in the County of Lincoln. He was succeeded by his grandson, the second Baronet. He married Anne Brownlow, daughter of Sir William Brownlow, 4th Baronet, of Humby and sister and sole heiress of John Brownlow, 1st Viscount Tyrconnel (and 5th Baronet, of Humby).', 'title': 'Baron Brownlow'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Sir James Montgomery, 4th Baronet (or Montgomerie, died 1694) was the tenth laird of Skelmorlie. He was a Scottish politician known for the Montgomery Plot, a Jacobite scheme to restore King James VII and II to the thrones of Scotland and England.', 'title': 'Sir James Montgomery, 4th Baronet'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Lieutenant-Colonel Sir James Nockells Horlick, 4th Baronet, OBE, MC (1886–1972) was the second son of Sir James Horlick, first holder of the Horlick Baronetcy, of Cowley Manor in the County of Gloucester, England, and Margaret Adelaide Burford. James, the 1st Baronet, was co-inventor (with his brother William) of Horlicks Malted Milk drink.', 'title': 'Sir James Horlick, 4th Baronet'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'On December 26, 2006, Gerald Ford, the 38th President of the United States, died at his home in Rancho Mirage, California at 6:45\xa0p.m. local time (02:45, December 27, UTC). At 8:49\xa0p.m. local time, President Ford\'s wife of 58 years, Betty Ford, issued a statement that confirmed his death: "My family joins me in sharing the difficult news that Gerald Ford, our beloved husband, father, grandfather and great grandfather has died at 93 years of age. His life was filled with love of God, his family and his country." The causes of death listed on the subsequent death certificate were arteriosclerotic cerebrovascular disease and cardiac arrest.', 'title': 'Death and state funeral of Gerald Ford'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Prachetasa is considered to be one of the most mysterious figures of Hindu mythology. It is an epithet for Varuna the god of water and its principle and as such are related to ‘shatabhoisag’ asterism. According to the puranas Prachetasa was one of the 10 Prajapatis who were ancient sages and law gives. But there is also a reference to 10 Prachetas who were sons of Prachinabarthis and great grandsons of Prithu. It is said that they lived for 10,000 years in a great ocean, very deeply engaged in meditation upon Vishnu and obtained from Him the boon of becoming the progenitors of mankind. They married a girl named Manisha, a daughter of Kanclu . Daksha was their son. But according to another version it is said that Prajapathi Daksha an ancient sage and contemporary of Lord Shiva, gave his 27 daughters in marriage to Soma ( Chandra). Soma was born from Marichi. But it is also said that Daksha was also the son of a woman called Marichi. Marichi is again referred to as the mother of Daksha. Thus it appears that Prachetasas were Daksha’s fathers as well as Daksha’s great grandsons. This confusion arises in Hindu families essentially because children are often named after their grandfather or great grandfather.', 'title': 'Prachethasa'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Franklin Seaver Pratt (November 1, 1829 – January 11, 1894), also known as Franklyn or Frank S. Pratt, was an American settler, businessman, public servant and diplomat of the Kingdom of Hawaii. He married Elizabeth Kekaʻaniau Laʻanui, a member of the Hawaiian nobility, and defended her claims to the Hawaiian crown lands during the overthrow of the Kingdom of Hawaii.', 'title': 'Franklin Seaver Pratt'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Ingerman (Ingram, Enguerrand) (c. 750-818), was a Frankish noble and Count of Hesbaye, son of Sigram of Hesbaye, a grandson of Sigramnus, Count of Hesbaye (a contemporary and ally of Charlemanges grandfather Charles Martel) and so a great-grandson of Lambert of Hesbaye, a man whose other daughter was Charlemanges grandmother, Rotrude of Triar. Therefore he was second cousins with Charlemagne through the same Great Grandfather. He was related by marriage to Robert II, Count of Hesbaye, who was grandfather of Robert the Strong. He was also nephew of Chrodegang, Archbishop of Metz and first abbot of the Lorsch Abbey.', 'title': 'Ingerman, Count of Hesbaye'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Teïspes (from Greek Τεΐσπης ; in Old Persian: 𐎨𐎡𐏁𐎱𐎡𐏁 "Cišpiš") ruled <a href="Anshan%20%28Persia%29">Anshann 675–640 BCE. He was the son of Achaemenes of Persis and an ancestor of Cyrus the Great. There is evidence that Cyrus I and Ariaramnes were both his sons. Cyrus I is the grandfather of Cyrus the Great, whereas Ariaramnes is great grandfather of Darius the Great. According to 7th-century BC documents, he captured the Elamite city of Anshan, speculated to have occurred after the Persians were freed from Median supremacy, and expanded his small kingdom. His kingdom was, however, a vassal state of the Neo Assyrian Empire (911–605 BCE). He was succeeded by his second son, Cyrus I.', 'title': 'Teispes'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Elizabeth Kekaʻaniau Laʻanui Pratt, full name Elizabeth Kekaikuihala Kekaʻaniauokalani Kalaninuiohilaukapu Laʻanui Pratt (12 September 1834 – 20 December 1928) was a great grandniece of Kamehameha I, being a great granddaughter of Kalokuokamaile, the older brother of Kamehameha I, founder of the Kingdom of Hawaii.', 'title': 'Elizabeth Kekaaniau'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Sir John Nigel Loring {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (1896–1979) was an Apothecary to British Royalty. The son of Nele and Mabel Alice (Isaac) Loring, he was born 31 August 1896. He was a seventh great grandson to New England immigrant Thomas Loring. His great great grandfather Joshua Loring had been a United Empire Loyalist and from his great great grandfather\'s generation this branch of the family returned to the British Isles.', 'title': 'Nigel Loring (surgeon)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Al-Fakhroh Tribe , (Arabic: آل فخروه\u200e \u200e ; also spelled Al-Fakhroo) attributing to their great grandfather Fakher from Banu Tamim. The name Fakhroh came from their great grandfather Fakher whose son of Tamim bin Mor bin Ad bin Muder bin Adnan which is considered as a very ancient Arab tribe dwelled by people from the midst of the Arabian Peninsula.', 'title': 'Al Fakhro'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Thomas Howard, 2nd Duke of Norfolk (1443 – 21 May 1524), styled Earl of Surrey from 1483 to 1485 and again from 1489 to 1514, was an English nobleman and politician. He was the only son of John Howard, 1st Duke of Norfolk, by his first wife, Katherine Moleyns. The Duke was the grandfather of both Queen Anne Boleyn and Queen Catherine Howard and the great grandfather of Queen Elizabeth I. He served four monarchs as a soldier and statesman.', 'title': 'Thomas Howard, 2nd Duke of Norfolk'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Maestro Armando Manuel Aurelio Ortega Carrillo was Director of Coro de la Escuela Secundaria y de Bachilleres de Orizaba (ESBO). His maternal great grandfather was the philanthropist Don Manuel Carrillo Tablas, who served as mayor of Orizaba, Veracruz, Mexico many times. His maternal grandfather (Manuel Carrillo Iturriaga) was also a member of the Mexican Legislature at the turn of the 20th century. His paternal grandfather was the illustrious Professor Don Aurelio Ortega y Placeres, considered one of the most brilliant educators of public instruction the state of Veracuz, Mexico produced. His father was the renowned poet and educator, Professor Don Aurelio Ortega Castañeda, who baptized the city of Orizaba with the title of "Nuestra Señora de los Puentes"("Our Lady of the bridges").', 'title': 'Maestro Armando Ortega'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Nigel Coan is a British animator, director, and writer best known for his contributions to the television series "The Mighty Boosh" and "Noel Fielding\'s Luxury Comedy" as well as the film Bunny and the Bull. Coan first met Noel Fielding and fellow Boosh actor Dave Brown at Buckinghamshire Chilterns University College (now Buckinghamshire New University), where they lived and attended art school together. Along with his partner Ivana Zorn and their production company "Nipple", Coan has produced work for companies such as Canon, Volvo, and Honda.', 'title': 'Nigel Coan'}
