 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Reza Sayed Badiyi also known as Reza Sayed Badiei (Persian: رضا بدیعی; April 17, 1929 – August 20, 2011) was an Iranian-American film director. Badiyi also directed episodes of many popular television series. His credits also include developing the opening montages for "Hawaii Five-O", "Get Smart", and "The Mary Tyler Moore Show".', 'title': 'Reza Badiyi'}
