 {'idx': 4, 'is_supporting': False, 'paragraph_text': "The Corridor (in Persian:دهلیز; transliterated as: Dehliz) is a 2013 Iranian drama film directed by Behrouz Shoeibi. Reza Attaran and Hanieh Tavassoli play the leading roles. The film mainly deals with the Islamic concept of Qisas. This was Shoeibi's debut film. As he has been a director's assistant and an actor, he didn't have some technical problems other first film directors do. This was also one of rare performances of Reza Attaran, not in a comic role. Hanieh Tavassoli won the crystal simorgh for best actress in a leading role in 31st Fajr International Film Festival.", 'title': 'The Corridor (2013 film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Mohammad Reza Shafiei Kadkani (Persian: محمدرضا شفیعی کدکنی\u200e \u200e , also [Romanize]d as "Mohammad–Reza Shafi\'i Kadkani") (born 1939) is a Persian writer, poet, literary critic, editor, and translator.', 'title': 'Mohammad-Reza Shafiei Kadkani'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Reza Parsa is a Swedish film director. At the age of 22 he was admitted to the 4-year directing program at the National Film School of Denmark (1991–95) and directed the most award winning (11 awards) graduation film, "Never (Gränsen)", in the history of the school.', 'title': 'Reza Parsa'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Faridur Reza Sagar (Bengali: ফরিদুর রেজা সাগর ) is a Bangladeshi writer and film producer. He is also the managing director of Impress Telefilm Ltd and Channel-i.', 'title': 'Faridur Reza Sagar'}
