 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Noel Maxam (born September 26) is an American television director, writer, and producer. Maxam has worked on the CBS Daytime drama "As the World Turns" as a writer, and, later, on "The Young and the Restless" where he directed for nearly 10 years. In 2007, he left to become Producer on the NBC drama "Days of Our Lives" and was promoted to Co-Executive Producer in 2011. In 2012, he left Days and is a freelance director. Recently he has directed for "The Young and the Restless", "Hollywood Heights" and "Disney". Noel Maxam is a graduate of the "Interlochen Arts Academy" (Diploma), "Carnegie Mellon University" (B.F.A. Directing) and the "University of Southern California" (M.F.A. in Film and Video Production).', 'title': 'Noel Maxam'}]

