 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Alberic III of Dammartin (Aubry de Dammartin) (died 1200 AD) was a French count and son of Alberic II, Count of Dammartin, and Clémence de Bar, daughter of Reginald I, Count of Bar.', 'title': 'Alberic III of Dammartin'}
