 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Pope Leo VII (Latin: "Leo VII" ; d. 13 July 939) was Pope from 3 January 936 to his death in 939. He was preceded by Pope John XI and followed by Pope Stephen VIII. Leo VII\'s election to the papacy was secured by Alberic II of Spoleto, the ruler of Rome at the time. Alberic wanted to choose the pope so that the papacy would continue to yield to his authority. Leo was the priest of the church of St. Sixtus in Rome, thought to be a Benedictine monk. He had little ambition towards the papacy, but consented under pressure.', 'title': 'Pope Leo VII'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Pope Agapetus II (died 8 November 955) was Pope from 10 May 946 to his death in 955. A nominee of the Princeps of Rome, Alberic II, his pontificate occurred during the period known as the Saeculum obscurum.', 'title': 'Pope Agapetus II'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Gregory I was the Count of Tusculum sometime between 954 and 1012. Consul et dux 961, vir illustrissimus 980, praefectus navalis 999. He was the son of Alberic II (son of Alberic I of Spoleto and Marozia), and Alda of Vienne (daughter of Hugh, King of Italy and his second wife, Alda (or Hilda)). His half-brother was Pope John XII.', 'title': 'Gregory I, Count of Tusculum'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Alberic II (912–954) was ruler of Rome from 932 to 954, after deposing his mother Marozia and his stepfather, King Hugh of Italy.', 'title': 'Alberic II of Spoleto'}]

