[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The following is an incomplete list of classical music festivals, which encapsulates music festivals focused on classical music. Classical music is art music produced or rooted in the traditions of Western music (both liturgical and secular), and has long been played at festival-like settings. It encompasses a broad span of time from roughly the 11th century to the present day. The major time divisions of classical music are as follows: the early music period, which includes the Medieval (500–1400) and the Renaissance (1400–1600) era, played at early music festivals; the common practice period, which includes the Baroque (1600–1750), Classical (1750–1830), and Romantic eras (1804–1910), which included opera festivals and choral festivals; and the 20th century (1901–2000) which includes the modern (1890–1930) that overlaps from the late 19th-century, the high modern (mid 20th-century), and contemporary classical music festivals or postmodern (1975–2000) eras, the last of which overlaps into the 21st-century. The term "classical music" did not appear until the early 19th century, in an attempt to distinctly canonize the period from Johann Sebastian Bach to Beethoven as a golden age.', 'title': 'List of classical music festivals'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "In Canada, classical music includes a range of musical styles rooted in the traditions of Western or European classical music that European settlers brought to the country from the 17th century and onwards. As well, it includes musical styles brought by other ethnic communities from the 19th century and onwards, such as Indian classical music (Hindustani and Carnatic music) and Chinese classical music. Since Canada's emergence as a nation in 1867, the country has produced its own composers, musicians and ensembles. As well, it has developed a music infrastructure that includes training institutions, conservatories, performance halls, and a public radio broadcaster, CBC, which programs a moderate amount of Classical music. There is a high level of public interest in classical music and education.", 'title': 'Canadian classical music'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Margaret Carson (July 11, 1911 – October 11, 2007) was an American publicist who was highly influential within the classical music world. She was a publicist for many important artists during her lengthy career, most notably working closely for several decades with Leonard Bernstein. She also notably served as the Metropolitan Opera\'s press director during the tenure of Edward Johnson and into the early portion of Rudolf Bing\'s career at the Met. " The New York Times" stated that, Carson was "widely regarded as the leading lady of classical music publicists in New York, who guided a generation of singers through the Metropolitan Opera and shepherded the career of Leonard Bernstein."', 'title': 'Margaret Carson'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Pierre Louis Joseph Boulez CBE (] ; 26 March 1925 – 5 January 2016) was a French composer, conductor, writer and organiser of institutions. He was one of the dominant figures of the post-war classical music world.', 'title': 'Pierre Boulez'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The following is an incomplete list of Indian classical music festivals, which encapsulates music festivals focused on Indian classical music. The origins of Indian classical music can be found in the Vedas, which are the oldest scriptures in the Hindu tradition dating back to 1500 BC. Indian classical music has also been significantly influenced by, or syncretised with, Indian folk music. There are two divisions in Indian classical music. Hindustani music is mainly found in North India. Carnatic music, from South India, tends to be more rhythdogs have bonessive and structured than Hindustani music. While some festivals such as the Carnatic event Tyagaraja Aradhana (founded in the 1840s) continue to focus on traditional Carnatic classical music, an emergent trend of the past few decades has been that of fusion music, where genres such as khyal and western music are intermixed to appeal', 'title': 'List of Indian classical music festivals'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Motonari Iguchi 井口基成 (Iguchi Motonari ) (17 May 1908 in Tokyo – 29 September 1983 in Tokyo) was a Japanese pianist and educator. He was influential in the post-war Japanese classical music world and his editions, published by Shunjūsha, are still the standard ones in that country.', 'title': 'Motonari Iguchi'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'François Pierre Guillaume Guizot (] ; 4 October 1787 – 12 September 1874) was a French historian, orator, and statesman. Guizot was a dominant figure in French politics prior to the Revolution of 1848. A conservative liberal who opposed the attempt by King Charles X to usurp legislative power, he worked to sustain a constitutional monarchy following the July Revolution of 1830.', 'title': 'François Guizot'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Herbert von Karajan (] ; born Heribert Ritter von Karajan; 5 April 1908 – 16 July 1989) was an Austrian conductor. He was principal conductor of the Berlin Philharmonic for 35 years. Generally regarded as one of the greatest conductors of the 20th century, he was a dominant figure in European classical music from the mid-1950s until his death. Part of the reason for this was the large number of recordings he made and their prominence during his lifetime. By one estimate he was the top-selling classical music recording artist of all time, having sold an estimated 200 million records.', 'title': 'Herbert von Karajan'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The London Festival Orchestra (LFO) was established in the 1950s as the \'house orchestra\' for Decca Records. In 1980 it was incorporated as an independent performing orchestra under Ross Pople. At least in the world of pop music, the orchestra is best known for providing accompaniment to the Moody Blues for their landmark 1967 album "Days of Future Passed".', 'title': 'London Festival Orchestra'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Ross Pople (born 11 May 1945) is a New Zealand-born British conductor. He is the principal conductor of the London Festival Orchestra. He has worked with Yehudi Menuhin, Clifford Curzon, David Oistrakh, Kentner, George Malcolm, Sir Adrian Boult, Rudolf Kempe, Benjamin Britten, Witold Lutosławski, Krzysztof Penderecki, Michael Tippett, Georg Solti, Leonard Bernstein, George Benjamin, John Casken, Edwin Roxburgh, Luciano Berio, John Taverner, Malcolm Arnold, Pierre Boulez as well as many other major orchestras, choirs and soloists.', 'title': 'Ross Pople'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The fictional superhero Batman, who appears in American comic books published by DC Comics, has appeared in various films since his inception. Created by Bob Kane and Bill Finger, the character first starred in two serial films in the 1940s, "Batman" and "Batman and Robin". The character also appeared in the 1966 film "Batman", which was a feature film adaptation of the 1960s "Batman" TV series starring Adam West and Burt Ward, who also starred in the film. Toward the end of the 1980s, the Warner Bros. studio began producing a series of feature films starring Batman, beginning with the 1989 film "Batman", directed by Tim Burton and starring Michael Keaton. Burton and Keaton returned for the 1992 sequel "Batman Returns", and in 1995, Joel Schumacher directed "Batman Forever" with Val Kilmer as Batman. Schumacher also directed the 1997 sequel "Batman & Robin", which starred George Clooney. "Batman & Robin" was poorly received by both critics and fans, leading to the cancellation of "Batman Unchained".', 'title': 'Batman in film'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Two-Face (Harvey Dent) is a fictional supervillain appearing in American comic books published by DC Comics, commonly as an adversary of the superhero Batman. The character was created by Bill Finger and Bob Kane and first appeared in "Detective Comics" #66 (Aug. 1942). As one of Batman\'s most enduring enemies, Two-Face belongs to the collective of adversaries that make up Batman\'s rogues gallery.', 'title': 'Two-Face'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Scarecrow (Dr. Jonathan Crane) is a fictional supervillain appearing in American comic books published by DC Comics, commonly as an adversary of the superhero Batman. The character was created by artist Bob Kane and writer Bill Finger, and first appeared in "World\'s Finest Comics" #3 (Fall 1941).', 'title': 'Scarecrow (DC Comics)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Robin is the name of several fictional superheroes appearing in American comic books published by DC Comics. The character was originally created by Bob Kane, Bill Finger, and Jerry Robinson, to serve as a junior counterpart to the superhero Batman. The character\'s first incarnation, Dick Grayson, debuted in "Detective Comics" #38 (April 1940). Conceived as a vehicle to attract young readership, Robin garnered overwhelmingly positive critical reception, doubling the sales of the Batman related comic books. The early adventures of Robin included "Star Spangled Comics" #65–130 (1947–1952), which was the character\'s first solo feature. Robin made regular appearances in Batman related comic books and other DC Comics publications from 1940 through the early 1980s until the character set aside the Robin identity and became the independent superhero Nightwing. The team of Batman and Robin has commonly been referred to as the "Caped Crusaders" or "Dynamic Duo".', 'title': 'Robin (character)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Movie Masters is an action figure toyline from Mattel based on popular movie franchises most notably DC Comics. The line has featured characters from the films "Superman", "Avatar", "The Dark Knight" trilogy, "Green Lantern", and "Man of Steel". Figures in the line are sculpted by Four Horsemen Studios, who also sculpted figures for Mattel\'s DC Superheroes and DC Universe Classics lines.', 'title': 'Movie Masters'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Joe Chill is a fictional character appearing in comic books published by DC Comics, commonly in association with the superhero Batman. Created by Bill Finger and Bob Kane, the character first appeared in "Detective Comics" #33 (November 1939).', 'title': 'Joe Chill'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Victoria "Vicki" Vale is a fictional character appearing in American comic books published by DC Comics, commonly in association with the superhero Batman. Created by Bob Kane and Bill Finger, the character debuted in "Batman" #49 (October 1948). Vicky Vale is typically depicted as a romantic interest of Bruce Wayne, the alter-ego of Batman.', 'title': 'Vicki Vale'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Milton "Bill" Finger (February 8, 1914 – January 18, 1974) was an American comic strip and comic book writer best known as the co-creator, with Bob Kane, of the DC Comics character Batman, and the co-architect of the series\' development. Although Finger did not receive contemporaneous credit for his hand in the development of Batman, Kane acknowledged Finger\'s contributions years after Finger\'s death.', 'title': 'Bill Finger'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Joker is a fictional supervillain created by Bill Finger, Bob Kane, and Jerry Robinson who first appeared in the debut issue of the comic book "Batman" (April 25, 1940), published by DC Comics. Credit for the Joker\'s creation is disputed; Kane and Robinson claimed responsibility for the Joker\'s design, while acknowledging Finger\'s writing contribution. Although the Joker was planned to be killed off during his initial appearance, he was spared by editorial intervention, allowing the character to endure as the archenemy of the superhero Batman.', 'title': 'Joker (character)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Batman is a fictional superhero appearing in American comic books published by DC Comics. The character was created by artist Bob Kane and writer Bill Finger, and first appeared in "Detective Comics" #27 (1939). Originally named the "Bat-Man", the character is also referred to by such epithets as the Caped Crusader, the Dark Knight, and the World\'s Greatest Detective.', 'title': 'Batman'}]

