 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The 1999 Wimbledon Championships – Women's Doubles was the women's doubles event of the hundred-and-thirteenth edition of Wimbledon, the third Grand Slam of the year, the most prestigious tournament on grass courts, and the oldest tennis tournament in the world. Martina Hingis and Jana Novotná were the defending champions but only Novotná competed that year with Natasha Zvereva. Novotná and Zvereva lost in the semifinals to Mariaan de Swardt and Elena Tatarkova.", 'title': "1999 Wimbledon Championships – Women's Doubles"}
