 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Serena Jameka Williams (born September 26, 1981) is an American professional tennis player. The Women's Tennis Association (WTA) has ranked her world No. 1 in singles on eight occasions, from 2002 to 2017. She became the world No. 1 for the first time on July 8, 2002. On the sixth occasion, she held the ranking for 186 consecutive weeks, tying the record set by Steffi Graf for the most consecutive weeks as world No. 1 by a female tennis player. In total, she has been world No. 1 for 319 weeks, which ranks her third in the Open Era among female tennis players. Some commentators, players and sports writers regard her as the greatest female tennis player of all time.", 'title': 'Serena Williams'}
