[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'United States v. Olano, 507 U.S. 725 (1993) , was a United States Supreme Court case that distinguished between forfeiture and waiver. Quoting from "Johnson v. Zerbst", 304 U.S. 458 (1938) , the Court noted, "Whereas forfeiture is the failure to make the timely assertion of a right, waiver is the "intentional relinquishment or abandonment of a known right... Whether a particular right is waivable; whether the defendant must participate personally in the waiver; whether certain procedures are required for waiver; and whether the defendant\'s choice must be particularly informed or voluntary, all depend on the right at stake."', 'title': 'United States v. Olano'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Stephen F. Freind (born 1944) is a Republican politician who served in the Pennsylvania General Assembly as the state representative for Delaware County from 1976 until 1993, when he unsuccessfully challenged Arlen Specter in the 1992 Republican primary election. He was most notable for authoring a law that was presented as a tort reform measure but was actually designed to restrict abortion rights, that included "requirements that a married woman notify her husband, that there be a 24-hour wait before any abortion, and that doctors show patients a pamphlet with pictures of developing fetuses". It was mostly upheld by the Supreme Court of the United States except for the spousal notification provision in the case of "Planned Parenthood v. Casey".', 'title': 'Stephen Freind'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Planned Parenthood v. Casey, 505 U.S. 833 (1992) , was a landmark United States Supreme Court case in which the constitutionality of several Pennsylvania state statutory provisions regarding abortion was challenged. The Court\'s plurality opinion reaffirmed the central holding of "Roe v. Wade" stating that "matters, involving the most intimate and personal choices a person may make in a lifetime, choices central to personal dignity and autonomy, are central to the liberty protected by the Fourteenth Amendment." The Court\'s plurality opinion upheld the constitutional right to have an abortion while altering the standard for analyzing restrictions on that right, crafting the "undue burden" standard for abortion restrictions. "Planned Parenthood v. Casey" differs from "Roe," however, because under "Roe" the state could not regulate abortions in the first trimester whereas under "Planned Parenthood v. Casey" the state can regulate abortions in the first trimester, or any point before the point of viability, and beyond as long as that regulation does not pose an undue burden on women\'s fundamental right to an abortion. Applying this new standard of review, the Court upheld four regulations and invalidated the requirement of spousal notification.', 'title': 'Planned Parenthood v. Casey'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Abortion in Oklahoma is legal under United States law, following the decision in "Roe v. Wade" in 1973. In 1992, the Supreme Court case "Planned Parenthood v. Casey" upheld the legality of abortion but granted states permission to create restrictions, so long as they did not create an "undue burden" for women who sought abortion.', 'title': 'Abortion in Oklahoma'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Montejo v. Louisiana, 556 U.S. 778 (2009), is a 5–4 decision by the United States Supreme Court that overruled the Court\'s decision in "Michigan v. Jackson", 475 U.S. 625 (1986) . The case concerned the validity of a defendant\'s waiver of his right to counsel during a police interrogation. In reversing "Jackson", the Court said such a waiver was valid.', 'title': 'Montejo v. Louisiana'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Brewer v. Williams, 430 U.S. 387 (1977) , is a decision by the United States Supreme Court that clarifies what constitutes "waiver" of the right to counsel for the purposes of the Sixth Amendment. Under "Miranda v. Arizona", evidence obtained by police during interrogation of a suspect before he has been read his Miranda rights is inadmissible. Here, however, the defendant had been indicted in court, and thus his Sixth Amendment right to counsel had automatically attached. At issue was whether a voluntary admission of incriminating facts in response to police statements constituted a waiver of this right to counsel.', 'title': 'Brewer v. Williams'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Nancy Northup is the President of The Center for Reproductive Rights, in New York City. The Center is a reproductive rights organization that uses constitutional and international law to secure women's reproductive freedom including abortion rights in over 45 countries. Under her leadership, the Center helped win Whole Woman's Health v. Hellerstedt, a Supreme Court case considered the most significant case won by the reproductive rights movement since Planned Parenthood v. Casey in 1992.", 'title': 'Nancy Northup'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ernest D. Preate, Jr. (born November 22, 1940) is a former Republican Pennsylvania Attorney General. As Attorney General, he argued before the United States Supreme Court in the landmark case, Planned Parenthood of Southeast Pennsylvania v. Casey on behalf of Robert P. Casey, then governor of Pennsylvania. Preate also successfully argued another landmark case, Blystone v. Pennsylvania in the United States Supreme Court addressing the death penalty.', 'title': 'Ernie Preate'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Stenberg v. Carhart, 530 U.S. 914 (2000), is a case heard by the Supreme Court of the United States dealing with a Nebraska law which made performing "partial-birth abortion" illegal, without regard for the health of the mother. Nebraska physicians who performed the procedure contrary to the law were subject to having their medical licenses revoked. The Court struck down the law, finding the Nebraska statute criminalizing "partial birth abortion[s]" violated the Due Process Clause of the United States Constitution, as interpreted in "Planned Parenthood v. Casey" and "Roe v. Wade".', 'title': 'Stenberg v. Carhart'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Gonzales v. Carhart, 550 U.S. 124 (2007), is a United States Supreme Court case that upheld the Partial-Birth Abortion Ban Act of 2003. The case reached the high court after U.S. Attorney General Alberto Gonzales appealed a ruling of the United States Court of Appeals for the Eighth Circuit in favor of LeRoy Carhart that struck down the Partial-Birth Abortion Ban Act. Also before the Supreme Court was the consolidated appeal of Gonzales v. Planned Parenthood from the United States Court of Appeals for the Ninth Circuit, which had struck down the Partial-Birth Abortion Ban Act.', 'title': 'Gonzales v. Carhart'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The 2014 Winter Olympics torch relay was run from October 7, 2013, 123 days prior to the Sochi 2014 Winter Olympics, until February 7, 2014, the day of the opening ceremony at Sochi. In Russia the relay traveled from Moscow to Sochi through 2,900 towns and villages across all 83\xa0federal subjects of Russia by foot, car, train, plane, and "troika" for over 65,000\xa0km of journey. The event became the longest relay in Winter Olympics history.', 'title': '2014 Winter Olympics torch relay'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Meghan Christina Agosta (born February 12, 1987) is a Canadian women's ice hockey forward, who last played for the Montreal Stars of the Canadian Women's Hockey League. Agosta plays for the Canada women's national ice hockey team and has represented Canada at the 2006 Winter Olympics in Turin, the 2010 Winter Olympics in Vancouver, and the 2014 Winter Olympics in Sochi, winning gold medals at all three. At the 2010 Winter Olympics, Agosta was named MVP of the Women's Hockey Tournament. She has also played at the Women's World Championship three times, capturing a gold medal and two silvers.", 'title': 'Meghan Agosta'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The 2014 Winter Olympics, officially called the XXII Olympic Winter Games (French: "Les XXIIes Jeux olympiques d\'hiver" ) (Russian: XXII Олимпийские зимние игры , "XXII Olimpiyskiye zimniye igry" ) and commonly known as Sochi 2014, were a major international multi-sport event held from 7 to 23 February 2014 in Sochi, Krasnodar Krai, Russia, with opening rounds in certain events held on the eve of the opening ceremony, 6 February 2014. Both the Olympics and 2014 Winter Paralympics were organized by the Sochi Organizing Committee (SOOC). Sochi was selected as the host city in July 2007, during the 119th IOC Session held in Guatemala City. It was the first Olympics in Russia since the breakup of the Soviet Union in 1991. The Soviet Union was previously the host nation for the 1980 Summer Olympics in Moscow. These were the first Olympic Games under the International Olympic Committee (IOC) presidency of Thomas Bach.', 'title': '2014 Winter Olympics'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Johan Hagbart Pedersen Grøttumsbraaten (12 February 1899 – 24 January 1983) was a Norwegian skier who competed in Nordic combined and cross-country. Dominating both events in the 1920s and early 1930s, he won several medals in the early Winter Olympics. Most notably, he won two gold medals at the 1928 Winter Olympics, and as one of the only two entrants to win two gold medalists from St. Moritz, was the most successful athlete there, along with Clas Thunberg of Finland. He previously won three medals (one silver, two bronzes) at the inaugural Winter Olympics held in Chamonix in 1924, and went on to defend his Olympic Nordic Combined at the 1932 Winter Olympics.', 'title': 'Johan Grøttumsbråten'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': "The 2007 Trail Appliances Autumn Gold Curling Classic was the 30th annual edition of the event. It marked the first Grand Slam event of the Women's World Curling Tour. It was held October 5-9 at the Calgary Curling Club in Calgary, Alberta. The total purse for the event was $56,000 with $14,000 going to the winning team of Jennifer Jones, Cathy Overton-Clapham, Jill Officer and Dawn Askin. They beat Shannon Kleibrink's rink in the final.", 'title': '2007 Trail Appliances Autumn Gold Curling Classic'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Canada hosted and participated in the 2010 Winter Olympics in Vancouver, British Columbia. Canada previously hosted the 1976 Summer Olympics in Montreal and the 1988 Winter Olympics in Calgary. Canada sent a team of 206 athletes (116 men, 90 women), including participants in all 15 sports, and finished with 14 gold medals and 26 in total (ranking 1st and 3rd respectively), surpassing their previous best medal performance at the 2006 Winter Olympics. The 14 gold medals also set the all-time record for most gold medals at a single Winter Olympics, one more than the previous record of 13 set by the former Soviet Union in 1976 and Norway in 2002. Canada was the first host nation to win the gold medal count at a Winter Olympics since Norway at the 1952 Winter Olympics.', 'title': 'Canada at the 2010 Winter Olympics'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Jennifer Judith Jones (born July 7, 1974) is a Canadian curler. She won an Olympic gold medal as skip of the Canadian team at the 2014 Sochi Games. She is the first female skip to go through the Games undefeated. The only male skip to achieve this is fellow Canadian Kevin Martin in 2010. Jones and her squad are the first Manitoba based curling team to win an Olympic gold medal. They won the 2008 World Women's Curling Championship, and were the last Canadian women's team to do so until Rachel Homan in 2017. Jones has won the national championship five times, most recently during the 2015 Scotties Tournament of Hearts. To go along with her national championships, Jones has also won the Manitoba provincial championship ten times, with a total of 12 Tournament of Heart appearances as of 2017.", 'title': 'Jennifer Jones (curler)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Chloe Kim (Korean: 김선, born April 23, 2000) is an elite American snowboarder, currently sponsored by Target. While being too young to compete in the 2014 Sochi Winter Olympics Kim earned silver in superpipe in the 2014 Winter X Games, coming behind Kelly Clark. In 2015 Chloe won Gold in the super pipe event in the Winter X Games beating Kelly Clark. With this win, at age 14, Kim became the youngest gold medalist until she lost this record to Kelly Sildaru who won gold in 2016 at the age of 13. In the 2016 X Games, she became the first person under the age of 16 to win three gold medals (and thus the first such person to win back-to-back gold medals) at an X Games. At that year's U.S. Snowboarding Grand Prix, she became the first woman to land back-to-back 1080 spins in a snowboarding competition. She scored a perfect 100 points, and is believed to be the second rider ever to do so, after Shaun White.", 'title': 'Chloe Kim'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Sochi 2014 was a successful bid by the Russian Olympic Committee to host the 2014 Winter Olympics and 2014 Winter Paralympics in Sochi, Russia. Sochi was one of seven applicants for the games, and one of three to be short-listed, along with Pyeongchang, South Korea, and Salzburg, Austria. Sochi is a resort city located on the Black Sea. The bid involved the city itself hosting ice events, while ski events were to be held at the ski resort in Krasnaya Polyana. The bid's advantages include ample hotel rooms and strong public and political support. Sochi also bid for the 2002 Winter Olympics, but failed to make the short-list.", 'title': 'Sochi bid for the 2014 Winter Olympics'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Rugby union, specifically in the sevens format, was introduced as a World Games sport for men at the 2001 World Games in Akita. Fiji entered the 2009 games as the two time defending Gold Medalists. Held on July 24 and 25 of 2009 in Taiwan, Fiji clinched gold for the 3rd time in front of a crowd of 39,000. The Fijian win preserves Fiji as the only nation to ever capture gold at the games. Represented were South Africa (the reigning IRB Sevens World Series Champions), Portugal (the reigning European Sevens Champions), Argentina (the reigning USA Sevens Champions), Fiji (the reigning World Games Gold Medalists), and Chinese Taipei (the host nation). The USA was the biggest disappointment of Day 1 going 0–3 having been expected to compete for a medal. The biggest surprise of the event was Portugal finding their way into the Gold Medal Match and coming away with the Silver Medal.', 'title': 'Rugby sevens at the 2009 World Games'}]

