 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Catherine Ann "Kate" Barnard (May 23, 1875 – February 23, 1930) was the first woman to be elected as a state official in Oklahoma, and the second woman to be elected to a statewide public office in the United States, in 1907. She served as the first Oklahoma Commissioner of Charities and Corrections for two four year terms (this position was the only one that the 1907 Oklahoma State Constitution permitted a woman to hold).', 'title': 'Kate Barnard'}
