 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Life Happens (stylized L!fe Happens) is a 2011 comedy film directed by Kat Coiro and written by Coiro and Krysten Ritter. The film stars Ritter, Kate Bosworth, Kristen Johnston, Geoff Stults, Jason Biggs, and Rachel Bilson. Ritter plays the main character, Kim, who lives with her two roommates, Deena (Bosworth) and Laura (Bilson), in Los Angeles. Kim becomes pregnant after a one-night stand so she turns to her friends for help. "L!fe Happens" opened in theaters on April 13, 2012.', 'title': 'Life Happens'}
