 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Secret Sunshine () is a 2007 South Korean drama film directed by acclaimed South Korean director, novelist, and former Minister of Culture Lee Chang-dong. The screenplay based on the short fiction "The Story of a Bug" by Lee Cheong-jun that focuses on a woman as she wrestles with the questions of grief, madness, and faith. The Korean title Miryang (or Milyang) is named after the city that served as the film\'s setting and filming location, of which "Secret Sunshine" is the literal translation. For her performance in the film, Jeon Do-yeon won the Prix d\'interprétation féminine du Festival de Cannes (Best Actress) at the 2007 Cannes Film Festival. The film also won the award for Best Film at the Asian Film Awards and at the Asia Pacific Screen Awards. The film sold 1,710,364 tickets nationwide in South Korea alone.', 'title': 'Secret Sunshine'}
