 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Han Sun-hwa (born October 6, 1990), is a South Korean singer and actress. She is a former member of the South Korean girl group Secret. She made her television debut in 2004 while participating in SBS\'s "Superstar Survival" as a finalist, and in 2009, she was a regular cast on a variety show called "Invincible Youth". Aside from music, she also ventured into acting and made her debut in the 2010 drama, "More Charming By The Day". She also acted in several dramas with supporting roles in "Ad Genius Lee Tae-baek", "God\'s Gift - 14 Days", and "Marriage, Not Dating". In 2014 she finally starred as a lead actress on MBC\'s weekend drama "Rosy Lovers" as Baek Jang Mi co-starring with actor Lee Jang Woo. CNN International Seoul listed Sunhwa as one of the nine rising "It" stars in Korean entertainment citing her as a "multi-tasking" artist. Her portrayal of Kang Se-Ah in the 2014 TVN drama, "Marriage, Not Dating" earned her a nomination for "Best Youth Actress" at the 16th Seoul International Youth Film Festival. In 2014, her portrayal of Jang-Mi from "Rosy Lovers" and Jenny from "God\'s Gift 14 Day"s won her two best new actress awards from MBC and SBS Drama Awards. It was confirmed on September 26, 2016 that Sunhwa had not renewed her contract with TS Entertainment and will officially part ways in October. On October 14, 2016 Sunhwa joined Huayi Brothers as an actress.', 'title': 'Han Sun-hwa'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Paul N. Saleh (born 1957), is an American business executive who served as the Chief Financial Officer (CFO) and Executive Vice President for Nextel Communications. He later served as interim chief executive officer (CEO) of Sprint Nextel Corporation in late 2007 and as the company's CFO from 2001 to 2008. In November, 2010 Mr. Saleh was named Gannett's Chief Financial Officer. In May, 2012 Mr. Saleh was named CSC's Chief Financial Officer and currently holds this position.", 'title': 'Paul Saleh'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 2014 Florida Chief Financial Officer election took place on November 4, 2014, which resulted in the re-election of the Florida Chief Financial Officer. Incumbent Republican Chief Financial Officer Jeff Atwater ran for re-election to a second term in office.', 'title': 'Florida Chief Financial Officer election, 2014'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Joshua Nyamweya Oigara is the Group Chief Executive Officer of the Kenya Commercial Bank Group. At age 37, his appointment in November 2012 to replace the outgoing CEO Martin Oduor-Otieno made him the youngest CEO of a publicly traded bank at the NSE. Prior to his appointment, he served as Chief Financial Officer and Member of the Board of Directors of the Company between January 12, 2012 and January 2013. He also served as Group Chief Financial Officer at KCB Bank Group for East Africa. He joined the Bank in November 2011 from Bamburi Cement where he served as Group Financial Director and Chief Financial Officer for the East Africa region. Oigara holds a Bachelor of Commerce degree from University of Nairobi and Master of Business Administration from Edith Cowan University and a host of other qualifications.', 'title': 'Joshua Oigara'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Luigi Ferraris (Legnano, 1962) is an Italian executive, Chief Executive Officer of Terna S.p.A. since April 2017. CEO of Enersis from 2014 to 2015, ex - Chairman of Enel Green Power, CFO of Enel Group and current Chief Financial Officer of Poste Italiane Group. Luigi Ferraris was also Chairman of Enel Green Power S.p.A. as well as Operating Chairman of Enel Factor S.p.A. In 2015 Luigi Ferraris was appointed Chief Financial Officer of Poste Italiane Group, in charge of managing its privatization process, one of the largest ever undertaken in Italy. He has had also the responsibility of implementing the Group’s Risk and Management Control functions, while starting a valorisation and optimization plan for Group’s Real Estate properties. Luigi Ferraris worked also as non executive Board Member of Banca del Mezzogiorno – Mediocredito Centrale, PSC S.p.A Group. He was Board Member of Erg S.p.A. a company listed in the Italian stock exchange. He had a teaching role or “Corporate Strategy” at LUISS University.', 'title': 'Luigi Ferraris (businessman)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': "The original News Corporation or News Corp. was an American multinational mass media corporation headquartered in New York City. It was the world's fourth-largest media group in 2014 in terms of revenue. Board members include prominent former Spanish prime minister José María Aznar.", 'title': 'News Corporation'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The Chief Financial Officers Act of 1990 (Public Law 101–576), or CFO Act, signed into law by President George H.W. Bush on November 15, 1990, is a United States federal law intended to improve the government's financial management, outlining standards of financial performance and disclosure. Among other measures, the Office of Management and Budget (OMB) was given greater authority over federal financial management. For each of 23 federal departments and agencies, the position of chief financial officer was created. In accordance with the CFO Act, each agency or department vests its financial management functions in its chief financial officer.", 'title': 'Chief Financial Officers Act'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Jeffrey "Jeff" S. Bornstein is an American business executive. He is a senior vice president and chief financial officer for General Electric. Previously, Bornstein served as chief financial officer of GE Capital and senior vice president of General Electric. Bornstein joined GE in 1989 with the GE Power Systems’ Financial Management Program. In 1992, he joined the GE Corporate Audit Staff and then became Executive Audit Manager. In 1996, he was named Chief Financial Officer for GE Aircraft Engine Services and Vice President in 1998. In 1999, he was promoted to Chief Financial Officer of GE Plastics and served as their CFO until 2002. He is on the board of Northeastern University and buildOn. He has also been involved in a number of youth programs. He received his B.S. in Business Administration from Northeastern University.', 'title': 'Jeff Bornstein'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'David "Dave" F. DeVoe (born 1947) has been a Director and Chief Financial Officer of News Corporation since 1990.', 'title': 'David DeVoe'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Professor Lloyd A. Levitin (born 1932) is an American businessman, former business executive, and currently professor of clinical finance and business economics at the University of Southern California's Marshall School of Business. He teaches financial analysis and valuation courses in the full-time MBA and undergraduate programs. He has published articles on corporate diversification and accountants' scope of liability for defective financial reports. He was simultaneously executive vice president, treasurer and chief financial officer of Pacific Enterprises (now Sempra Energy), as well as executive vice president and chief financial officer of the Southern California Gas Company (wholly owned subsidiary of Pacific Enterprises). He has 31 years of experience in corporate management. Prior thereto, he was associate professor of business at San Francisco State University. He also has a CPA certificate.", 'title': 'Lloyd Levitin'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Ellis E. Cousens (born 1952) is Executive Vice President, Chief Financial Officer and Chief Operations Officer of John Wiley & Sons, Inc., since March 2001. Previously Senior Vice President, Chief Financial Officer of Bookspan, a Bertelsmann AG and Time Warner Inc. joint venture, from March 2000; Vice President, Finance and Strategic Planning, of Bertelsmann AG from March 1999; Vice President, Chief Financial Officer of BOL.com, a subsidiary of Bertelsmann AG, from August 1998). Earned a Bachelor's degree from Hunter College, Master of Science from Rensselaer Polytechnic Institute and an MBA in Finance from the Hagan School of Business of Iona College. Graduated DeWitt Clinton High School, Bronx, NY class of 1970.", 'title': 'Ellis Cousens'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"The Guest" (French: "L\'Hôte" ) is a short story by the French writer Albert Camus. It was first published in 1957 as part of a collection entitled "Exile and the Kingdom" ("L\'exil et le royaume"). The French title "L\'Hôte" translates into both "the guest" and "the host" which ties back to the relationship between the main characters of the story. Camus employs this short tale to reflect upon issues raised by the political situation in French North Africa. In particular, he explores the problem of refusing to take sides in the colonial conflict in Algeria, something that mirrors Camus\' own non-aligned stance which he had set out in his Nobel Prize acceptance speech.', 'title': 'The Guest'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Henry Louis Mencken (September 12, 1880 – January 29, 1956) was an American journalist, satirist, cultural critic and scholar of American English. Known as the "Sage of Baltimore", he is regarded as one of the most influential American writers and prose stylists of the first half of the twentieth century. He commented widely on the social scene, literature, music, prominent politicians and contemporary movements. His satirical reporting on the Scopes trial, which he dubbed the "Monkey Trial", also gained him attention.', 'title': 'H. L. Mencken'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Herbert Lottman (August 16, 1927, Brooklyn - August 27, 2014, Paris) was an American author who specialized in writing biographies on French subjects. An influential biographer, he published 17 biographies, 15 of which were related to French culture, commerce, or politics; including works on Albert Camus, Colette, Gustave Flaubert, Henri Philippe Pétain, Jules Verne, and the Rothschild banking family of France. He wrote that, just before dying, Albert Camus was pledged to marry. Camus's estate tried to block his book, partly because of this controversial statement.", 'title': 'Herbert Lottman'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Albert Camus (] ; 7 November 1913 – 4 January 1960) was a French philosopher, author, and journalist. His views contributed to the rise of the philosophy known as absurdism. He wrote in his essay "The Rebel" that his whole life was devoted to opposing the philosophy of nihilism while still delving deeply into individual freedom. He won the Nobel Prize in Literature in 1957.', 'title': 'Albert Camus'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Fall (French: La Chute ) is a philosophical novel by Albert Camus. First published in 1956, it is his last complete work of fiction. Set in Amsterdam, "The Fall" consists of a series of dramatic monologues by the self-proclaimed "judge-penitent" Jean-Baptiste Clamence, as he reflects upon his life to a stranger. In what amounts to a confession, Clamence tells of his success as a wealthy Parisian defense lawyer who was highly respected by his colleagues; his crisis, and his ultimate "fall" from grace, was meant to invoke, in secular terms, The Fall of Man in the Garden of Eden. "The Fall" explores themes of innocence, imprisonment, non-existence, and truth. In a eulogy to Albert Camus, existentialist philosopher Jean-Paul Sartre described the novel as "perhaps the most beautiful and the least understood" of Camus\' books.', 'title': 'The Fall (Camus novel)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Possessed (in French Les Possédés) is a play written by Albert Camus in 1959. The piece is a theatrical adaptation of Fyodor Dostoyevsky\'s novel "The Possessed", later renamed "Demons". Camus despised nihilism and viewed Dostoyevsky\'s work as a prophecy about nihilism\'s devastating effects. He directed a production of the play at the Théâtre Antoine in 1959, the year before he died, which he financed in part with the money he received with his Nobel Prize. It was a critical success as well as an artistic and technical tour de force: 33 actors, 4 hours long, 7 sets, 24 scenes. The walls could move sideways to reduce the size of each location and the whole stage rotated to allow for immediate set transformations. Camus put the painter and set decorator Mayo, who had already illustrated several of his novels (L\'Etranger - 1948 Ed.) , in charge of the demanding task of designing these multiple and complex theater sets', 'title': 'The Possessed (play)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Rebel (French: "L\'Homme révolté" ) is a 1951 book-length essay by Albert Camus, which treats both the metaphysical and the historical development of rebellion and revolution in societies, especially Western Europe. Camus relates writers and artists as diverse as Epicurus and Lucretius, Marquis de Sade, Georg Wilhelm Friedrich Hegel, Fyodor Dostoyevsky, Friedrich Nietzsche, Max Stirner, André Breton, and others in an integrated, historical portrait of man in revolt. Examining both rebellion and revolt, which may be seen as the same phenomenon in personal and social frames, Camus examines several \'countercultural\' figures and movements from the history of Western thought and art, noting the importance of each in the overall development of revolutionary thought and philosophy.', 'title': 'The Rebel (book)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Marcel J. Mélançon is a Canadian philosopher and scientist. He was born in Saint-Barnabé, Quebec, in 1938, and is mostly known for his book on the French philosopher Albert Camus "Albert Camus, An Analysis of his thought" (Albert Camus. Analyse de sa pensée). He has mostly worked together with the biologist Richard D. Lambert.', 'title': 'Marcel J. Melançon'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "L’Étranger (The Outsider [UK], or The Stranger [US]) is a 1942 novel by French author Albert Camus. Its theme and outlook are often cited as examples of Camus' philosophy of the absurd and existentialism, though Camus personally rejected the latter label.", 'title': 'The Stranger (novel)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Reflections on the Guillotine" is an extended essay written in 1957 by Albert Camus. In the essay Camus takes an uncompromising position for the abolition of the death penalty. Camus\'s view is similar to that of Cesare Beccaria and the Marquis de Sade, the latter having also argued that murder premeditated and carried out by the state was the worst kind. Camus states that he does not base his argument on sympathy for the convicted but on logical grounds and on proven statistics. Camus also argues that capital punishment is an easy option for the government where remedy and reform may be possible.', 'title': 'Reflections on the Guillotine'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Assault on Truth: Freud\'s Suppression of the Seduction Theory is a book by Jeffrey Moussaieff Masson, in which the author argues that Sigmund Freud deliberately suppressed his early hypothesis, known as the seduction theory, that hysteria is caused by sexual abuse during infancy, because he refused to believe that children are the victims of sexual violence and abuse within their own families. Masson reached this conclusion while he had access to some of Freud\'s unpublished letters as projects director of the Sigmund Freud Archives. "The Assault on Truth" was first published in 1984, and several revised editions have since been published.', 'title': 'The Assault on Truth'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Why Freud Was Wrong: Sin, Science and Psychoanalysis (1995; second edition 1996; third edition 2005) is a book by Richard Webster, in which the author provided a critique of Sigmund Freud and psychoanalysis. Webster argued that Freud became a kind of Messiah and that psychoanalysis is a pseudo-science and a disguised continuation of the Judaeo-Christian tradition. Webster endorsed Gilbert Ryle\'s arguments against mentalist philosophies in "The Concept of Mind" (1949); he also criticized many other authors for their treatment of Freud and psychoanalysis. The book for which Webster may be best remembered, "Why Freud Was Wrong" has been called "brilliant" and "definitive", but has also been criticized for shortcomings of scholarship and argument. "Why Freud Was Wrong" formed part of the "Freud wars", an ongoing controversy around psychoanalysis.', 'title': 'Why Freud Was Wrong'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Peter J. Swales (born 1948) is a Welsh "guerilla historian of psychoanalysis", and former assistant to the Rolling Stones, who has written essays and letters about Sigmund Freud. A 1998 article in The New Republic magazine noted his "...remarkable detective work over the last 25 years, revealing the true identities of several early patients of Freud\'s who had been known only by their pseudonyms." He is one of three men (the others are Freud Archives director Kurt R. Eissler and psychoanalyst Jeffrey Masson) whose machinations are described in the 1984 book In The Freud Archives, which originated as two articles in The New Yorker magazine that provoked Masson to file an unsuccessful $10 million libel suit against the magazine and its writer Janet Malcolm.', 'title': 'Peter Swales (historian)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'From its premiere at the turn of the 17th century, "Hamlet" has remained Shakespeare\'s best-known, most-imitated, and most-analyzed play. The character of Hamlet played a critical role in Sigmund Freud\'s explanation of the Oedipus complex and thus influenced modern psychology. Even within the narrower field of literature, the play\'s influence has been strong. As Foakes writes, "No other character\'s name in Shakespeare\'s plays, and few in literature, have come to embody an attitude to life [...] and been converted into a noun in this way."', 'title': 'Critical approaches to Hamlet'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Oedipus Rex, also known by its Greek title, Oedipus Tyrannus (Ancient\xa0Greek: Οἰδίπους Τύραννος IPA: [oidípuːs týranːos]), or Oedipus the King, is an Athenian tragedy by Sophocles that was first performed around 429 BC. Originally, to the ancient Greeks, the title was simply "Oedipus" ("Οἰδίπους"), as it is referred to by Aristotle in the "Poetics". It is thought to have been renamed "Oedipus Tyrannus" to distinguish it from "Oedipus at Colonus". In antiquity, the term “tyrant” referred to a ruler, but it did not necessarily have a negative connotation.', 'title': 'Oedipus Rex'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Life and Work of Sigmund Freud is a biography of Sigmund Freud by Ernest Jones. The most famous and influential biography of Freud, "The Life and Work of Sigmund Freud" was originally published in three volumes (first volume 1953, second volume 1955, third volume 1957); a one-volume edition abridged by literary critics Lionel Trilling and Steven Marcus followed in 1961. When first published, "The Life and Work of Sigmund Freud" was acclaimed, and sales exceeded expectations. Although his biography has retained its status as a classic, Jones has been criticized for presenting an overly favorable image of Freud.', 'title': 'The Life and Work of Sigmund Freud'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Freud: A Life for Our Time is a 1988 biography of Sigmund Freud, the founder of psychoanalysis, by the historian Peter Gay. The work is based partly on new material that has become available since the publication of Ernest Jones\' "The Life and Work of Sigmund Freud" (1953). The book has been praised, but has also been criticized by several authors skeptical of psychoanalysis.', 'title': 'Freud: A Life for Our Time'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Freud and Philosophy: An Essay on Interpretation (French: "De l\'interprétation. Essai sur Sigmund Freud" ) is a 1965 book about Sigmund Freud by the philosopher Paul Ricœur. Sometimes grouped with works such as Jürgen Habermas\'s "Knowledge and Human Interests" (1968), "Freud and Philosophy" has received praise, but critics have argued Ricœur provides a mistaken interpretation of Freud.', 'title': 'Freud and Philosophy'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Interpretation of Dreams (German: "Die Traumdeutung" ) is a 1899 book by psychoanalyst Sigmund Freud, in which the author introduces his theory of the unconscious with respect to dream interpretation, and discusses what would later become the theory of the Oedipus complex. Freud revised the book at least eight times and, in the third edition, added an extensive section which treated dream symbolism very literally, following the influence of Wilhelm Stekel. Freud said of this work, "Insight such as this falls to one\'s lot but once in a lifetime."', 'title': 'The Interpretation of Dreams'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': '"Dostoevsky and Parricide" (German: "Dostojewski und die Vatertötung" ) is an introductory article contributed by Sigmund Freud to a scholarly collection on "The Brothers Karamazov" by Fyodor Dostoyevsky. The collection was published in 1928. The article argues that it is no coincidence that some of the greatest works of world literature - including "Oedipus Rex", "Hamlet", as well as "The Brothers Karamazov" – all concern parricide, which in Dostoevsky\'s case Freud links to his epilepsy.', 'title': 'Dostoevsky and Parricide'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Tata Sons Limited is the holding company of the Tata Group and holds the bulk of shareholding in these companies. It was established as a trading enterprise in 1868. About 86% of the equity capital of Tata Sons is held by philanthropic trusts endowed by members of the Tata family. The biggest two of these trusts are the Sir Dorabji Tata Trust and Sir Ratan Tata Trust. Tata Sons is the owner of the Tata name and the Tata trademarks, which are registered in India and several other countries. TCS alone generates 70% revenues of its parent company, Tata Sons. Natarajan Chandrasekaran took over as Chairman of Tata Sons on 21 February 2017.', 'title': 'Tata Sons'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Faqir Chand Kohli (born 28 February 1924) popularly known as F. C. Kohli is an Indian industrialist. He is frequently referred to as the "Father of the Indian Software Industry" due to his significant contribution in Indian IT industry. He was the founder and first CEO of Tata Consultancy Services, India\'s largest software consultancy company. He has also worked as the deputy general manager of the Tata Power Company. He is also on the board of governors of College of Engineering, Pune.', 'title': 'F. C. Kohli'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Subramanian Ramadorai, CBE ( born 6 October 1945) was the adviser to the Prime Minister of India in the national council on skill development, Government of India. He held the rank equivalent to an Indian Cabinet Minister. He is also the chairperson of the governing board of the Tata Institute of Social Sciences and Bharathidasan Institute of Management, chairman of Indian Institute of Information Technology, Guwahati and Tata Elxsi. Earlier, he was CEO and MD of Tata Consultancy Services from 1996 to 2009 & Vice - Chairman of Tata Consultancy Services till 6 October 2014 transforming TCS from a company with $400 million revenues and 6000 employees to one of the world's largest software and services company with more than 200,000 employees working in 42 countries and revenues over US$6.0 billion.", 'title': 'Subramaniam Ramadorai'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "LC Singh is the Vice Chairman and CEO of Nihilent Technologies Ltd. , a global integrated change management company headquartered at Pune, India. Singh founded Nihilent in the year 2000. Singh is an alumnus of the Institute of Technology (Banaras Hindu University) ,Varanasi] and Harvard Business School, and has contributed significantly towards building the Indian IT brand worldwide. Singh performed key roles at Tata Consultancy Services (TCS). At the time of leaving the company, he was the Senior Vice President, in charge of operations for UK, South Africa and the Middle East. He briefly worked with Zensar Technologies as President and CEO. He is the author of Nihilent's patented change management framework MC³ and 14Signals (a patented framework on Customer Loyalty Evaluation). He is an internationally internationally recognized thought leader on design & systems thinking, and is an invited speaker at global conferences on Design Thinking, Change Management, and Digital Disruption. Singh is a Fellow of The Institute of Management Consultants of India (IMCI) and Computer Society of India (CSI). He scripted and produced the movie Banaras, A mystic love story. He continues to be a student of ontology and epistemology", 'title': 'LC Singh'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Tata Consultancy Services Limited (TCS) is an Indian multinational information technology (IT) service, consulting and business solutions company Headquartered in Mumbai, Maharashtra. It is a subsidiary of the Tata Group and operates in 46 countries.', 'title': 'Tata Consultancy Services'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Dr. Lalit Kanodia (born March 30, 1941) is an Indian business entrepreneur, credited with having created the software industry of India as the Founder CEO of Tata Consultancy Services (TCS), earlier called Tata Computer Center during 1967-1970. He is currently Chairman of Datamatics Group of Companies which he founded in 1975. He also holds the position of National President of the Indo - American Chamber of Commerce and Vice President of the Indian Merchants Chamber, both prestigious organizations of the Indian business community. He has also served as President of the Management Consultants Association of India.', 'title': 'Lalit Surajmal Kanodia'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "CMC Limited was an information technology services, consulting and software company having its headquarters in New Delhi, India. CMC is part of the TATA Group and is owned by Tata Consultancy Services. CMC was incorporated on 26 December 1975, as the 'Computer Management Corporation Private Limited'. The Government of India held 100 per cent of the equity share capital and owned by government of India. On 19 August 1977, it was converted into a public limited company. In October 2001, CMC was privatized by the Government of India, in a sale to India-based Tata Consultancy Services (TCS), the largest software services company in Asia. It also features on top ten companies in India.", 'title': 'CMC (company)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Natarajan Chandrasekaran (born 1963) is the chairman of Tata Sons. Chandrasekaran took over as the CEO of Tata Consultancy Services (TCS) on November 6, 2009 prior to which he was COO and executive director of TCS. Born in 1963, Chandra is one of the youngest CEOs within the Tata Group. In January 2017, he was selected to become the next chairman of Tata Sons. He assumed chairmanship on 21 February 2017 and soon after was announced the chairman of Tata Motors. on July 3, he was appointed as chairman of Tata Global Beverages. He is the first non Parsi and professional executive to head the Tata Group.', 'title': 'Natarajan Chandrasekaran'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Tata Information Technology (Shanghai) Co., Ltd is a Wholly Foreign Owned Enterprise (WFOE) operated by Tata Consultancy Services Ltd. in China. Tata Consultancy Services Ltd (TCS) commenced its operations through its wholly owned foreign enterprise in Shanghai in June, 2002. Subsequently, TCS has set up a global development center in Hangzhou and a liaison office in Beijing. In fact, TCS is the first Indian company to set up a development center in China. Tata Consultancy Services in China is the first CMMI & PCMM Level 5 Company in China.', 'title': 'TCS China'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Rajesh Gopinathan (born 1971) is the CEO and Managing Director of Tata Consultancy Services (TCS). Rajesh took over as the CEO of TCS on February 21, 2017, prior to which he was CFO and Vice President of TCS. Born in 1971, Rajesh is one of the youngest CEOs of the Tata Group.', 'title': 'Rajesh Gopinathan'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Manglietia is a genus of flowering plants in the family Magnoliaceae. There are about 40 species native to Asia.', 'title': 'Manglietia'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Abronia villosa is a species of sand-verbena known by the common names desert sand-verbena and chaparral sand-verbena. It is in the four o'clock plant family (Nyctaginaceae). It is native to the deserts of the southwestern United States and northern Mexico and the southern California and Baja coast.", 'title': 'Abronia villosa'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ajuga , also known as bugleweed, ground pine, carpet bugle, or just bugle, is a genus of 40 species annual and perennial herbaceous flowering plantsin the mint family Lamiaceae, with most species native to Europe, Asia, and Africa, but also two species in southeastern Australia. They grow to 5–50\xa0cm tall, with opposite leaves.', 'title': 'Ajuga'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Jumellea is an orchid genus with around 40 species native to Madagascar, the Comoros, the Mascarenes, and eastern Africa. In horticulture, it is often abbreviated Jum. It is named after H. L. Jumelle, a French botanist.', 'title': 'Jumellea'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Abronia, the sand-verbenas or wild lantanas, is a genus of about 20 species of annual or perennial herbaceous plants in the family Nyctaginaceae. Despite the common names, they are not related to "Verbena" (vervains) or lantanas in the family Verbenaceae. They are closely allied with "Tripterocalyx".', 'title': 'Abronia (plant)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Macroclinium is a genus of flowering plants from the orchid family, Orchidaceae. It contains about 30-40 species native to the tropical Western Hemisphere.', 'title': 'Macroclinium'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Octarrhena is a genus of flowering plants from the orchid family, Orchidaceae. It contains about 30-40 species native to Sri Lanka, Indonesia, Malaysia, the Philippines, New Guinea, Queensland, and assorted islands in the western Pacific.', 'title': 'Octarrhena'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Abronia maritima is a species of sand verbena known by the common name red sand verbena. This is a beach-adapted perennial plant native to the coastlines of southern California, including the Channel Islands, and northern Baja California. It grows along stable sand dunes near, but not in, the ocean surf.', 'title': 'Abronia maritima'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Abronia turbinata is a species of flowering plant in the four o'clock family known by the common name transmontane sand-verbena. It is native to eastern California and Oregon and western Nevada, where it grows in desert and plateau scrub.", 'title': 'Abronia turbinata'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Uncaria is a genus of flowering plants in the family Rubiaceae. It has about 40 species. Their distribution is pantropical, with most species native to tropical Asia, three from Africa and the Mediterranean and two from the neotropics. They are known colloquially as gambier, cat\'s claw or uña de gato. The latter two names are shared with several other plants. The type species for the genus is "Uncaria guianensis.', 'title': 'Uncaria'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Rumford Medal is an award bestowed by Britain\'s Royal Society every alternating year for "an outstandingly important recent discovery in the field of thermal or optical properties of matter made by a scientist working in Europe". First awarded during 1800, it was created after a 1796 donation of $5000 by the scientist Benjamin Thompson, known as Count Rumford, and is accompanied by a gift of £1000. Since its inception, the award has been granted to 101 scientists, including Rumford himself during 1800. It has been awarded to citizens of the United Kingdom fifty-three times, Germany seventeen times, France fourteen times, the Netherlands seven times, Sweden four times, the United States three times, Italy twice and once each to citizens of Australia, Hungary, Belgium, Luxembourg and New Zealand.', 'title': 'Rumford Medal'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Reek Sunday (Irish: "Domhnach na Cruaiche" ) or Garland Sunday is an annual day of pilgrimage in Ireland. On the last Sunday in July, pilgrims climb Ireland\'s holiest mountain, Croagh Patrick (764 metres) in County Mayo. It is held in honour of Saint Patrick who, in the year 441, spent 40 days fasting on the mountain. Masses are held at the summit, where there is a small chapel. Some climb the mountain barefoot, as an act of penance, and some carry out \'rounding rituals\', which were formerly a key part of the pilgrimage. This involves praying while walking sunwise around features on the mountain. They walk seven times around the cairn of Leacht Benáin (Benan\'s grave), fifteen times around the circular perimeter of the summit, seven times around Leaba Phádraig (Patrick\'s bed), and then seven times around three ancient cairns known as Reilig Mhuire (Mary\'s cemetery).', 'title': 'Reek Sunday'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Celina Seghi (born 6 March 1920) is a former Italian alpine skier. Born in Abetone, Tuscany, she was the youngest child in a family of nine and earned her first Italian championship medal, a bronze in the slalom, in 1934. In 1937 she earned three national titles, her first victories at that level, by winning the slalom, downhill, and combined events. In total she won a total of 25 gold, 6 silver, and 3 bronze medals at the Italian National Championships: gold seven times, silver thrice, and bronze twice in the downhill, gold and silver once each in the giant slalom, gold ten times, silver twice, and bronze once in the slalom, and gold seven times in the combined.', 'title': 'Celina Seghi'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Kristian Olaf Bernhard Birkeland (13 December 1867 – 15 June 1917) was a Norwegian scientist. He is best remembered as the person whose theories of atmospheric electric currents elucidated the nature of the aurora borealis. In order to fund his research on the aurorae, he invented the electromagnetic cannon and the Birkeland-Eyde process of fixing nitrogen from the air. Birkeland was nominated for the Nobel Prize seven times.', 'title': 'Kristian Birkeland'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Wesley Silcox (born May 30, 1985, in Santaquin, Utah) is an American professional bull rider. He is of English descent. He competes in the Professional Rodeo Cowboys Association (PRCA) and Championship Bull Riding (CBR) tour. He has qualified for the PRCA's National Finals Rodeo seven times (2005-2008, 2010–11, 2015) and the CBR world finals seven times (2005–10, 2013). He was the PRCA world champion bull rider in 2007 and the PRCA Xtreme Bulls Tour champion in 2010.", 'title': 'Wesley Silcox'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'A substorm, sometimes referred to as a magnetospheric substorm or an auroral substorm, is a brief disturbance in the Earth\'s magnetosphere that causes energy to be released from the "tail" of the magnetosphere and injected into the high latitude ionosphere. Visually, a substorm is seen as a sudden brightening and increased movement of auroral arcs. Substorms were first described in qualitative terms by Kristian Birkeland which he called polar elementary storms. Sydney Chapman used the term substorm about 1960 which is now the standard term. The morphology of aurora during of a substorm was first described by Syun-Ichi Akasofu in 1964 using data collected during the International Geophysical Year.', 'title': 'Substorm'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Simon Poelman (born 27 May 1963) is a former New Zealand decathlete, who has been described as New Zealand's best ever all-round athlete. In the decathlon, his personal best of 8359 points (which is adjusted from 8366 points as it was hand timed) is still a New Zealand national record. This was set at the national athletics championships in Christchurch 1987. As well as being the national decathlon champion seven times. He was also the New Zealand senior men's national champion in several individual events including the 100m (once), 110m hurdles (seven times), long jump (twice), pole vault (three times), and shot put (once).", 'title': 'Simon Poelman'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Dysosmia is a disorder described as any qualitative alteration or distortion of the perception of smell. Qualitative alterations differ from quantitative alterations, which include anosmia and hyposmia. Dysosmia can be classified as either parosmia (also called troposmia) or phantosmia. Parosmia refers to a distortion in the perception of an odorant. Odorants smell different from what one remembers. Phantosmia refers to the perception of an odor when there's no actual odorant present. The cause of dysosmia still remains a theory. It is typically considered a neurological disorder and clinical associations with the disorder have been made. Most cases are described as idiopathic and the main antecedents related to parosmia are URTIs, head trauma, and nasal and paranasal sinus disease. Dysosmia tends to go away on its own but there are options for treatment for patients that want immediate relief.", 'title': 'Dysosmia'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Bifurcation theory is the mathematical study of changes in the qualitative or topological structure of a given family, such as the integral curves of a family of vector fields, and the solutions of a family of differential equations. Most commonly applied to the mathematical study of dynamical systems, a bifurcation occurs when a small smooth change made to the parameter values (the bifurcation parameters) of a system causes a sudden \'qualitative\' or topological change in its behaviour. Bifurcations occur in both continuous systems (described by ODEs, DDEs or PDEs) and discrete systems (described by maps). The name "bifurcation" was first introduced by Henri Poincaré in 1885 in the first paper in mathematics showing such a behavior. Henri Poincaré also later named various types of stationary points and classified them.', 'title': 'Bifurcation theory'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Robert K. Yin is an American social scientist and President of COSMOS Corporation, known for his work on case study research as well as on qualitative research. Over the years, his work on case study research has been frequently cited. Google Scholar listed it as the second highest methodological work (see Table 3 in the following link), qualitative or quantitative, over a 20-year period:', 'title': 'Robert K. Yin'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Grace Church School is a private school whose original building is located at 86 Fourth Avenue between East 10th and East 12th Streets in the East Village neighborhood of the borough of Manhattan in New York City. The school was founded in 1894 by the Grace Church as the first choir boarding school in New York City. The private day school, which much resembles the school today, began in 1934. Grace Church School's High School Division opened in 2012 and is located at 46 Cooper Square. In the 2015-16 school year, the school opened for the first time as a Junior Kindergarten through 12th grade program.", 'title': 'Grace Church School'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Sainik School Balachadi ("Hindi: सैनिक शाला बालाचडी" ), Jamnagar, Gujarat, is one of the Top Sainik School in the Chain of 26 Sainik Schools in India. It is one of the boarding school for public education in Gujarat.It was established in July 1961 by then the Honorable Prime Minister Sri Lal Bahadur Shastri. It is an elite English medium, fully residential boarding school for boys providing Premium public school education with a Military bias up to 10+2 stage as per the Central Board of Secondary Education. The Chain of Sainik Schools in India was established as a prime focus of strengthening the Armed Forces and All India Services IAS & IPS, and other fields of Public services. The School is Located at a distance of 32\xa0km from the main city of Jamnagar alongside a coastal area. The campus facing the Gulf of Kutch is encompassed with a Bungalow of The Ruler of Nawanagar Maharaja Jam Shaheb Digvijaysinhji Ranjitsinhji, Sachana Ship Breaking Yard and a natural sea beach.', 'title': 'Sainik School Balachadi, Jamnagar'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Vishwajyoti Higher Secondary School was initially established in the year 2051 B.S (1994 A.D) by a group of highly experienced professional in the field of education at Pragatinagar – 3, Nawalparasi, Nepal, in collaboration with Nawal English Boarding School, established at Rajhar V.D.C. in the year 2039 B.S (1982 A.D) to promote it from Primary Level to Secondary Level and was run under the name of Nawal English Boarding School (NEBS) upto 2056 B.S (1999 A.D). NEBS was later merged into Vishwa Jyoti English Boarding School in the year 2057 B.S (2000 A.D). In the year 2064 B.S (2007 A.D) the school upgraded itself to the Higher Secondary Level, affiliated to the Higher Secondary Education Board (H.S.E.B.) and started running classes in the science and management stream. official website', 'title': 'Vishwajyoti Higher Secondary School'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Regional Resettlement Arrangement between Australia and Papua New Guinea, colloquially known as the PNG solution, is the name given to an Australian government policy in which any asylum seeker who comes to Australia by boat without a visa will be refused settlement in Australia, instead being settled in Papua New Guinea if they are found to be legitimate refugees. The policy includes a significant expansion of the Australian immigration detention facility on Manus Island, where refugees will be sent to be processed prior to resettlement in Papua New Guinea, and if their refugee status is found to be non-genuine, they will be either repatriated, sent to a third country other than Australia or remain in detention indefinitely. The policy was announced on 19 July 2013 by Australian Prime Minister Kevin Rudd and Papua New Guinean Prime Minister Peter O'Neill, effective immediately, in response to a growing number of asylum seeker boat arrivals. The then Opposition Leader Tony Abbott initially welcomed the policy, while Greens leader Christine Milne and several human rights advocate groups opposed it, with demonstrations protesting the policy held in every major Australian city after the announcement.", 'title': 'PNG solution'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Concho Indian Boarding School (also known as the Cheyenne-Arapaho Boarding School at Concho or Concho Indian School and home to the Concho Demonstration School) was a boarding school for members of the Cheyenne and Arapaho Tribes and later opened to other Native American students. It existed from 1909 to 1983. It was located in central Oklahoma, approximately 1 mile south of Concho, Oklahoma and 4 miles north of El Reno, Oklahoma. The name of the town and school is the Spanish word for "shell" and was named for the Indian agent, Charles E. Shell.', 'title': 'Concho Indian Boarding School'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Princeton High School was founded in 1867 and graduated its first class in 1869. The school was started as a boarding school and taught subjects as English, mathematics, history, and the sciences. The school was enlarged in both 1894 and 1908 in order to accommodate for increases in attendance. The school was completely destroyed by fire on December 15, 1924. Plans were then drawn up to build a new school, but in the mean time classes were held in City Hall, the Post Office, and the Christian and Mission Covenant Churches in Princeton. The new school opened its doors on September 27, 1926. The building, 350 ft long and 100 ft wide, contained twenty classrooms; an auditorium seating 1,100; a library; a science lecture room; chemistry, physics and botanical laboratories; and a gymnasium. The building is still in use today, though several additions and remodelings have taken place since then.', 'title': 'Princeton High School (Illinois)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Grennaskolan Boarding School is a Swedish boarding school located in Gränna, Jönköping County. Grennaskolan Boarding School was founded in 1963 by Stockholm University and has today approximately 200 students, half of whom are boarding school students and half of whom are international students.', 'title': 'Grennaskolan'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Cotter High School is the sole Roman Catholic High School in Winona, Minnesota, and is one of the first in the state. Today, Cotter Schools consists of the Cotter High School and Cotter Junior High School. The school opened its doors on September 5, 1911 as the "Cotter School for Boys". Cotter, named for the diocese’s first bishop, Bishop Joseph Bernard Cotter, was a boys school directed by the Christian Brothers of Saint John Baptist de La Salle. In 1952, the Brothers turned the operation of the school over to the diocese and Cotter became co-educational with the combining of the Cathedral Girls High School. In 1953 a new Cotter building was erected and in 1962 an addition was added. In 1992, with help from an endowment from the Hiawatha Education Foundation, the school moved to its current location on the campus of the former College of Saint Teresa, allowing it to add a boarding school component.', 'title': 'Cotter High School (Winona, Minnesota)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Westminster School is an independent, Uniting Church, Early Learning to Year 12, coeducational, day and boarding school located at Marion, South Australia, 12\xa0km south of Adelaide. Founded as a Methodist day and boarding school for boys, the school was opened by the Prime Minister Robert Menzies in 1961 and is named after Westminster School in London. The school became co-educational in 1978, and has a current enrolment of around 1150 students.', 'title': 'Westminster School, Adelaide'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Marion is a suburb in the City of Marion in Adelaide around 10\xa0km south-west of the CBD. Founded as a rural village in 1838 on the banks of the Sturt River, Marion was found to have rich soil and the population expanded rapidly. Colonel William Light laid out the plan for the village, as he had done with the City of Adelaide itself.', 'title': 'Marion, South Australia'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Amway North America (formerly known as Quixtar North America) is an American worldwide multi-level marketing (MLM) company, founded 1959 in Ada, Michigan, United States. It is privately owned by the families of Richard DeVos and Jay Van Andel through Alticor which is the holding company for businesses including Amway, Amway Global, Fulton Innovation, Amway Hotel Corporation, Hatteras Yachts, and manufacturing and logistics company Access Business Group. After the launch of Amway Global (originally operating under the name Quixtar) it replaced the Amway business in the United States, Canada and the Caribbean, with the Amway business continuing to operate in other countries around the world. On May 1, 2009, Quixtar made the name change to Amway Global and fused the various different entities of the parent company.', 'title': 'Amway North America'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Amway (short for "American Way") is an American company specializing in the use of multi-level marketing to sell health, beauty, and home care products. The company was founded in 1959 by Jay Van Andel and Richard DeVos and is based in Ada, Michigan.', 'title': 'Amway'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "This is a list of seasons completed by the Grand Rapids Rampage. The Rampage were a professional arena football franchise of the Arena Football League (AFL), based in Grand Rapids, Michigan. The team was established in 1998. The origins of the franchise date back to 1988, where they were the Detroit Drive, and then the Massachusetts Marauders for one season in 1994, but folded after that season. Three years later, Dan DeVos, son of Amway co-founder and current owner of the NBA's Orlando Magic, Richard DeVos, bought the franchise out of bankruptcy court, moved them to Grand Rapids, and renamed them the Rampage. The Rampage won ArenaBowl XV, and were regular playoff contenders from 1999 to 2003. After this however, the Rampage did not win more than five games until 2008. In the 2008 season, the Rampage were 6–10 and got to the conference championship, but fell short of a second ArenaBowl appearance. Prior to the 2009 season, the AFL announced that it had suspended operations indefinitely and canceled the 2009 season. The franchise did not return when the league resumed operations in . The Rampage played their home games at Van Andel Arena.", 'title': 'List of Grand Rapids Rampage seasons'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Richard Marvin DeVos Sr. (born March 4, 1926) is an American businessman, co-founder of Amway along with Jay Van Andel (company restructured as Alticor in 2000), and owner of the Orlando Magic NBA basketball team. In 2012, "Forbes" magazine listed him as the 60th wealthiest person in the United States, and the 205th richest in the world, with an estimated net worth of $5.1 billion. At one point, he was one of the 10 wealthiest Americans.', 'title': 'Richard DeVos'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Alticor is an American corporation, privately owned and run by American families of DeVos and Van Andel. It was established in 1999 to serve as the parent company for a handful of business ventures, most notably the multi-level marketing company Amway and Amway Global, and a manufacturing and distribution company, Access Business Group. In 2006, Alticor purchased cosmetics maker Gurwitch Products from Neiman Marcus Group Inc., and operated it as a wholly owned subsidiary until Gurwitch was acquired by Shiseido in 2016.', 'title': 'Alticor'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Van Andel Institute (VAI) is a 501(c)(3) nonprofit medical research institute in Grand Rapids, Michigan. VAI was founded by Jay and Betty Van\xa0Andel in 1996 and is composed of two institutes: Van\xa0Andel Research Institute (VARI) and Van\xa0Andel Education Institute (VAEI). VARI scientists study the genetic, cellular, and molecular origins of cancer and several other degenerative diseases, notably Parkinson's. VAEI offers various science education programs for students K-12, professional development for science teachers, and a graduate school for college students pursuing biomedical research.", 'title': 'Van Andel Institute'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Doug DeVos (born october 6, 1964 in Grand Rapids, Michigan) is an American businessman. As President of Amway since 2002, Doug DeVos oversees daily operations of the company with Chairman Steve Van Andel. Together, they form the Office of the Chief Executive. DeVos is the youngest son of Helen June (Van Wesep) and Amway co-founder Rich DeVos, who, with Steve’s father Jay Van Andel, started Amway in Ada, Michigan, in 1959.', 'title': 'Doug DeVos'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Grand Rapids Medical Mile is a designated area within the city of Grand Rapids, Michigan. It began with medical-related development in the Hillside District Grand Rapids, Michigan, bordering both sides of Michigan Street. More than a decade later it encompasses an area five times larger. It has also been referred to as Grand Rapids Medical Corridor, Michigan Street Medical Corridor, Health Hill, Medical Hill, and Pill Hill, among other names. It was started in 1996 with the founding of Van Andel Institute by Jay and Betty Van Andel. It has since expanded to include the Grand Rapids Community College's Calkins Science Center across Bostwick Avenue, Spectrum Health's Butterworth Hospital complex, Grand Valley State University's Cook-DeVos Center for Health Sciences, and Michigan State University Secchia Center Medical School, among other facilities in the area.", 'title': 'Grand Rapids Medical Mile'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Jeffrey M. Trent is the founding president and director of the Translational Genomics Research Institute. He has been Vice President and Research Director of the Van Andel Institute since 2009. He was the founding director of NIH's National Human Genome Research Institute in 1993.", 'title': 'Jeffrey Trent'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Jay Van Andel (June 3, 1924 – December 7, 2004) was an American businessman, best known as co-founder of the Amway Corporation, along with Richard DeVos.', 'title': 'Jay Van Andel'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Lieutenant Colonel Iceal E. "Gene" Hambleton, USAF (November 16, 1918 – September 19, 2004) was a United States Air Force navigator and electronic warfare officer who was shot down over South Vietnam during the 1972 Easter Offensive. He was aboard an EB-66 aircraft whose call sign was Bat 21. As the ranking navigator/EWO on the aircraft, he was seated immediately behind the pilot, giving him the call sign "Bat 21 Bravo". He survived for 11½ days behind enemy lines until he was retrieved in a daring ground operation. His rescue was the longest and most costly search and rescue mission during the Vietnam War. He received the Silver Star, the Distinguished Flying Cross, the Air Medal, the Meritorious Service Medal and a Purple Heart for his actions during this mission.', 'title': 'Iceal Hambleton'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Behind Enemy Lines II: Axis of Evil is a 2006 American war film and the sequel to "Behind Enemy Lines". The film was written and directed by James Dodson, starring Nicholas Gonzalez, Matt Bushell, Keith David, Denis Arndt, Ben Cross, Bruce McGill and Peter Coyote. Justifying its title, the film follows the first part, and was released direct-to-video on October 17, 2006.', 'title': 'Behind Enemy Lines II: Axis of Evil'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Evasion charts, are maps made for servicemembers to be used when caught behind enemy lines to perform escape and evasion, escape maps were secreted to prisoners of war by various means to aid in escape attempts. During World War II, these maps were used by many American, British, and allied servicemen to escape from behind enemy lines. "The Allies needed to be able to print their clandestine maps on a material that would be hardier than paper -- material that wouldn\'t tear or dissolve in water" Modern evasion charts, produced for the US, UK, and NATO printed on vinyl sheet in the 1960s and currently of Tyvek \'paper\', permit printing of minute detail while remaining waterproof and tear-resistant.', 'title': 'Escape and evasion map'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Operation Halyard (or Halyard Mission), known in Serbian as Operation Air Bridge (Serbian: Операција Ваздушни мост ), was an Allied airlift operation behind enemy lines during World War II. In July 1944, the Office of Strategic Services (OSS) drew up plans to send a team to Chetniks led by General Draža Mihailović in the German-occupied Territory of the Military Commander in Serbia for the purpose of evacuating Allied airmen shot down over that area. This team, known as the Halyard team, was commanded by Lieutenant George Musulin, along with Master Sergeant Michael Rajacich, and Specialist Arthur Jibilian, the radio operator. The team was detailed to the United States Fifteenth Air Force and designated as the 1st Air Crew Rescue Unit. It was the largest rescue operation of American Airmen in history. According to historian Professor Jozo Tomasevich, a report submitted to the OSS showed that 417 Allied airmen who had been downed over occupied Yugoslavia were rescued by Mihailović's Chetniks, and airlifted out by the Fifteenth Air Force. According to Lt. Cmdr. Richard M. Kelly (OSS) grand total of 432 U.S. and 80 Allied personnel were airlifted during the Halyard Mission.", 'title': 'Operation Halyard'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Special reconnaissance (SR) is conducted by small units of highly trained military personnel, usually from special forces units or military intelligence organizations, who operate behind enemy lines, avoiding direct combat and detection by the enemy. As a role, SR is distinct from commando operations, but both are often carried out by the same units. The SR role frequently includes covert direction of air and missile attacks, in areas deep behind enemy lines, placement of remotely monitored sensors and preparations for other special forces. Like other special forces, SR units may also carry out direct action (DA) and unconventional warfare (UW), including guerrilla operations.', 'title': 'Special reconnaissance'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Colonel Daniel J. Miller was born in Stony Point, New York. He enlisted in the United States Army Air Forces during World War II and served in the 826th Bombardment Squadron as a navigator in a B-24 Liberator. During the Korean War, he flew various aircraft, including the F-86 Sabre jet fighter. In the late Korean War and throughout the Vietnam War, he flew helicopter rescue missions. He was awarded the Silver Star during the Korean War in the 3rd Rescue Squadron. He braved heavy enemy fire in low visibility to rescue USMC Major Frank H. Presley. Immediately after rescuing Presley, his P-51 fighter escort was shot down, and he once again braved the fire to attempt to rescue USAF Captain Willis R. Brown, but Brown had failed to eject and had perished. In addition, he was also awarded the Cheney Award for a rescue in February 1951, when he rescued six wounded soldiers behind enemy lines in three attempts despite snow and enemy fire. During Vietnam, he flew rescue missions and commanded a light reconnaissance squadron, the 19th Tactical Air Support Squadron.', 'title': 'Daniel J. Miller'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Behind Enemy Lines is a 2001 American war film directed by John Moore in his directorial debut, and starring Owen Wilson and Gene Hackman. The film tells the story of Lieutenant Chris Burnett, an American naval flight officer who is shot down over Bosnia and uncovers genocide during the Bosnian War. Meanwhile, his commanding officer is struggling to gain approval to launch a combat search and rescue mission to save Burnett. The plot is loosely based on the 1995 Mrkonjić Grad incident that occurred during the war.', 'title': 'Behind Enemy Lines (2001 film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The "Behind Enemy Lines" series is a series of war films beginning with "Behind Enemy Lines" in 2001, followed by films in 2006, 2009 and 2014. All four films feature the United States Armed Forces.', 'title': 'Behind Enemy Lines (film series)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'SEAL Team 8: Behind Enemy Lines is a 2014 American war film directed by Roel Reiné and starring Tom Sizemore. It is the fourth installment in the "Behind Enemy Lines" series. The film was released on direct-to-video and Blu-ray on April 1, 2014.', 'title': 'SEAL Team 8: Behind Enemy Lines'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The rescue of Bat 21 Bravo, the call sign for Iceal "Gene" Hambleton, from behind North Vietnamese lines was the "largest, longest, and most complex search-and-rescue" operation during the Vietnam War.', 'title': 'Rescue of Bat 21 Bravo'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Yakuza, known in Japan as Ryū ga Gotoku (龍が如く , "Like a Dragon") , is an open world action-adventure beat \'em up video game franchise created, owned and published by Sega. The series originated from Toshihiro Nagoshi\'s desire to create a game that would tell the way of life of the "yakuza". Nagoshi initially struggled to find a platform for the project, until Sony showed interest in the prospect.', 'title': 'Yakuza (series)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Double Dragon (Japanese: <ruby ><rb>双截龍</rb><rp> (</rp><rt >ダブルドラゴン</rt><rp>)</rp></ruby> , Hepburn: Daburu Doragon ) is a 1987 beat \'em up video game developed by Technōs Japan and distributed in North America and Europe by Taito. The game is a spiritual and technological successor to Technos\' earlier beat \'em up, "Nekketsu Kōha Kunio-kun" (released outside of Japan by Taito as "Renegade"), but introduced several additions such as two-player cooperative gameplay and the ability to arm oneself with an enemy\'s weapon after disarming them. "Double Dragon" is considered to be one of the first successful examples of the genre, resulting in the creation of two arcade sequels and several spinoffs, as well as inspiring other companies in creating their own beat \'em ups.', 'title': 'Double Dragon (video game)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Cartoon Network: Battle Crashers is a side-scrolling beat 'em up video game developed by French studio Magic Pockets and published by GameMill Entertainment. It was released for Nintendo 3DS, PlayStation 4, and Xbox One, on 8 November 2016. The game received extremely negative reviews from several video game journalists, who panned it as a repetitive and boring beat 'em up with bland representations of otherwise unique characters. A port for the Nintendo Switch will be released on 14 November 2017.", 'title': 'Cartoon Network: Battle Crashers'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Gekido: Urban Fighters is a beat \'em up video game for the PlayStation console, created by Italian studio Naps Team. The game uses a fast paced beat \'em up system, with many bosses and a colorful design in terms of graphics. The game features the music of Fatboy Slim and Apartment 26. Marvel comic book artist Joe Madureira also contributed. Versions of "Gekido" were also planned for the Game Boy Color and N-Gage but were never released. It was later followed by a GBA spin-off called "". A second sequel had been announced, entitled "Gekido: The Dark Angel".', 'title': 'Gekido'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Beat \'Em and Eat \'Em is an erotic pornographic video game for the Atari 2600 by Mystique in 1982. Distribution was handled by American Multiple Industries until distribution changed to Game Source. Players control two nude women; the goal is to catch sperm falling from a masturbating man on a rooftop without missing. Its gameplay has been compared to the Atari game "Kaboom! ". There is also a gender-reversed version of the game titled Philly Flasher that features identical gameplay. "Beat \'Em & Eat \'Em" has received negative reception since its release and is an oft-cited example of pornographic Atari 2600 games.', 'title': "Beat 'Em &amp; Eat 'Em"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Ryū ga Gotoku: Kiwami 2 (unofficially known as Yakuza Kiwami 2) is an action-adventure video game developed and published by Sega. It is a remake of the 2006 video game "Yakuza 2", and is the series\' second remake title following 2016\'s "Yakuza Kiwami". It is being developed using the Dragon game engine from "Yakuza 6". The game is set to be released for PlayStation 4 on December 7, 2017 in Japan.', 'title': 'Yakuza Kiwami 2'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Yakuza Kiwami is a 2016 action-adventure game developed by Sega for the PlayStation 3 and PlayStation 4. It is a remake of "Yakuza", the first video game in the "Yakuza" series. Similarly to "Yakuza 0", the prequel installment before it, "Yakuza Kiwami" was released exclusively on PlayStation 4 in Europe and North America in August 2017. A "Kiwami" remake of "Yakuza 2" is set for a Japanese release in December 2017.', 'title': 'Yakuza Kiwami'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Die Hard Arcade, known in Japan as Dynamite Deka (ダイナマイト刑事 , Dainamaito Deka , lit. "Dynamite Detective") is a beat \'em up video game released by Sega. It was the first beat \'em up to use texture-mapped polygonal graphics. An original property in Japan, the game was published outside Japan by Fox Interactive as a licensed product based on the "Die Hard" movie franchise. Released in 1996 for arcades, the game was ported to the Sega Saturn in 1997 and the PlayStation 2 (Japan only) in the Sega Ages line in 2006. A sequel, "Dynamite Cop", was released for arcades and Dreamcast in 1998 without the "Die Hard" license.', 'title': 'Die Hard Arcade'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Alien vs. Predator (エイリアンVSプレデター) is a beat 'em up video game developed and released by Capcom for the CPS-2 arcade game system in 1994. In the game, the players take control of up to three out of four human and Predator characters in a battle against the Alien hordes and rogue human soldiers. The game was very well received by the public and by media publications, becoming a classic title for many fans of the beat 'em up genre, but was never ported to any home system.", 'title': 'Alien vs. Predator (arcade game)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Yakuza 5 (Japanese: 龍が如く5 夢、叶えし者 , Hepburn: Ryū ga Gotoku 5: Yume Kanaeshi Mono , "Like a Dragon 5: Fulfiller of Dreams") , is a 2012 open world action-adventure video game developed and published by Sega for the PlayStation 3. The game is the fifth main entry in the "Yakuza" series of action-adventure games. The game was released in December 2012 in Japan, and localized for North America, Europe and Australia as a PlayStation Network download exclusive in December 2015. The game features a new graphics engine, unlike previous PS3 games in the series that have been re-utilizing the same engine since "Ryū ga Gotoku Kenzan! ". For the first time in the series, it features five settings across Japan along with five playable main characters. This game is also the first in the series to have a digital only release in the West.', 'title': 'Yakuza 5'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Boston United Football Club is an English football club based in Boston, Lincolnshire. The club participates in the National League North, the sixth tier of English football. The club is known as 'the Pilgrims' in reference to the Pilgrim Fathers, who left England and sailed to North America and founded Boston, Massachusetts. The club's crest, the pilgrim fathers' ship 'The Mayflower', is also a reference to them. The club's traditional colours are amber and black. Boston's neighbours include Lincoln City, Scunthorpe United and Grimsby Town. The club is one of only 12 in the country to run a Centre of Excellence, provides a Study Support Centre and is also the basis of the 'Boston United Football in the Community Scheme'.", 'title': 'Boston United F.C.'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'James Neil (born 28 February 1976) is an English former professional footballer who played in the English Football League between 1994 and 1999, and played on the right side of midfield. He could also be used at right back. During his career he played for Grimsby Town, Scunthorpe United and Grantham Town.', 'title': 'Jimmy Neil'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Pacific Bell Telephone Company (Pacific Bell) provides telephone service in California. The company is owned by AT&T Inc. through AT&T Teleholdings. The company has been known by a number of names during which its service area has changed. The formal name of the company from the 1910s through the 1984 Bell System divestiture was The Pacific Telephone and Telegraph Company. As of 2002, the name “Pacific Bell” is no longer commonly used.', 'title': 'Pacific Bell'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The Scunthorpe Telegraph is a local paid-for newspaper published and distributed weekly in Scunthorpe, England. It was launched on 8 September 1937. Prior to the "Scunthorpe Telegraph"\' s launch, the town was served by the "Grimsby Evening Telegraph".', 'title': 'Scunthorpe Telegraph'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "The Reid Newfoundland Company was incorporated in September 1901 and was the operator of the Newfoundland Railway across the island from 1901 to 1923. For a time it was the largest landowner in the country. The company was founded by Sir Robert Gillespie Reid of Scotland, a businessman who had interests in the development of the Pulp and paper industry and mining industry. The company was also the owner and operator of the coastal boat service, known as the Alphabet Fleet, the telegraph line and the electrical service in St. John's.", 'title': 'Reid Newfoundland Company'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Baron Pavel L'vovitch Schilling, also known as Paul Schilling (5 April 1786, Reval (now, Tallinn), Russian empire – St. Petersburg, Russia, 25 July 1837), was a diplomat of Baltic German origin employed in the service of Russia in Germany, and who built a pioneering electrical telegraph. It consisted of a single needle system which used a telegraph code to indicate the characters in a message.", 'title': 'Pavel Schilling'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'CS "Telconia" was an English cable ship used in the early 20th century to lay and repair submarine communications cables. It was built in 1909 by Swan Hunter & Wigham Richardson for the Telegraph Construction and Maintenance Company (a subsidiary of the Atlantic Telegraph Company) and remained in service until late 1934.', 'title': 'Telconia'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Grimsby Telegraph is a daily British regional newspaper for the town of Grimsby and the surrounding area that makes up North East Lincolnshire including the rural towns of Market Rasen and Louth. The main area for the paper\'s distribution is in or around Grimsby and Cleethorpes. It is published six days a week (daily except Sundays) with a free sister paper ("Grimsby Target") being published once per week.', 'title': 'Grimsby Telegraph'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The People's Republic of China possesses a diversified communications system that links all parts of the country by Internet, telephone, telegraph, radio, and television. The country is served by an extensive system of automatic telephone exchanges connected by modern networks of fiber-optic cable, coaxial cable, microwave radio relay, and a domestic satellite system; cellular telephone service is widely available, expanding rapidly, and includes roaming service to foreign countries. Fiber to the x infrastructure has been expanded rapidly in recent years.", 'title': 'Telecommunications in China'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Rugby Radio Station was a radio transmission facility at Hillmorton near the town of Rugby, Warwickshire in England, situated just west of the A5 trunk road and in later years junction 18 of the M1 motorway. Its large very low frequency (VLF) transmitter came into service on 1 January 1926 and was originally used to transmit telegraph messages to the Commonwealth as part of the Imperial Wireless Chain. After the 1950s this transmitter, active as callsign GBR on 16.0\xa0kHz, using Morse code and later on 15.975\xa0kHz with frequency-shift keying FSK and minimum-shift keying MSK, was used for transmitting messages to submerged submarines. Criggion radio station acted as a reserve. The GBR transmitter was shut down on 1 April 2003 and was replaced by a new one at the Skelton transmitting station.', 'title': 'Rugby Radio Station'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Homestead Extension of Florida\'s Turnpike (HEFT), designated as State Road 821 (SR 821) and the Ronald Reagan Turnpike, is the southern extension of Florida\'s Turnpike, a toll road in Florida operated by Florida\'s Turnpike Enterprise (FTE). Spanning approximately 48 mi along a north-south axis, it supplements the 265 mi "mainline" (designated as SR 91) to form the complete 309 mi turnpike. The extension begins at its southern terminus at US Highway 1 (US 1) in Florida City, and transitions into the SR 91 mainline in Miramar at its northern end. Despite their designations as different state roads, the mainline and the extension are continuous in their exit numbering.', 'title': "Homestead Extension of Florida's Turnpike"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Florida City is a city in Miami-Dade County, Florida, United States and is the southernmost municipality in the South Florida metropolitan area. Florida City is primarily a Miami suburb and a major agricultural area.', 'title': 'Florida City, Florida'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "State Road 9336 (SR 9336), also known in parts as the Ingraham Highway, Tower Road and West Palm Drive, is an 8.75 mi two- to four-lane road in Miami-Dade County, in the U.S. state of Florida. The route is the only signed four-digit state road in Florida. The route connects US 1, and the Homestead Extension of Florida's Turnpike by proxy, in Florida City with the Everglades National Park, acting as the park's primary mode of entry. The road continues on from its western terminus at the national park's entrance as Main Park Road for another 39.3 mi , providing access to many of the park's facilities and the ghost town of Flamingo, in Monroe County, at its western end.", 'title': 'Florida State Road 9336'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'St. Petersburg is a city in Pinellas County, Florida, United States. As of the 2015 census estimate, the population was 257,083, making it the fifth-most populous city in Florida and the largest in the state that is not a county seat (the city of Clearwater is the seat of Pinellas County).', 'title': 'St. Petersburg, Florida'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'State Road 366 (SR 366) is a short east–west route in Tallahassee between US 27 and SR 20. It is primarily known as Pensacola Street throughout its path, due to its generally westward course toward the Florida city of Pensacola, although an eastbound section is known as St. Augustine Road, heading toward St. Augustine.', 'title': 'Florida State Road 366'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Conch Republic is a micronation declared as a tongue-in-cheek secession of the city of Key West, Florida, from the United States on April 23, 1982. It has been maintained as a tourism booster for the city since. Since then, the term "Conch Republic" has been expanded to refer to "all of the Florida Keys, or, that geographic apportionment of land that falls within the legally defined boundaries of Monroe County, Florida, northward to \'Skeeter\'s Last Chance Saloon\' in Florida City, Dade County, Florida, with Key West as the nation\'s capital and all territories north of Key West being referred to as \'The Northern Territories\'.', 'title': 'Conch Republic'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'John Constantine Williams, Sr. (died 1892) was the cofounder of St. Petersburg, Florida. Williams Park is named for him.', 'title': 'John Constantine Williams Sr.'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Florida's Turnpike, designated as State Road 91 (SR 91) and the Ronald Reagan Turnpike, is a toll road in Florida, maintained by Florida's Turnpike Enterprise (FTE). Spanning approximately 309 mi along a north–south axis, the turnpike is in two sections. The SR 91 mainline runs roughly 265 mi , from its southern terminus at an interchange with Interstate 95 (I-95) in Miami Gardens to an interchange with I-75 in Wildwood at its northern terminus. The Homestead Extension of Florida's Turnpike (abbreviated HEFT and designated as SR 821) continues from the southern end of the mainline for another 48 mi to US Highway 1 (US 1) in Florida City.", 'title': "Florida's Turnpike"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Williams Park is a park located in St. Petersburg, Florida. It is the city\'s first park and encompasses an entire city block between 4th and 3rd Streets North and between 2nd and 1st Avenues North. Founded in 1888 and originally named "City Park," it was changed to Williams Park in honor of the founder of St. Petersburg, John Constantine Williams Sr..', 'title': 'Williams Park'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'State Road 997 (SR 997), also known as Krome Avenue and West 177th Avenue is a 36.7 mi north–south state highway in western Miami-Dade County, Florida. It runs from U.S. Route 1 just south of Florida City north across U.S. Route 41 to U.S. Route 27 near Countyline Dragway (formerly Opa-locka West Airport), just south of the Broward County line. Its main use is as a bypass around the western side of Miami, linking the routes that run southwest, west and northwest from that city. The road passes through newer suburbs in the southern third of its length, while the northern two thirds of the highway traverse the eastern edge of the Everglades.', 'title': 'Florida State Road 997'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Inspector Wears Skirts () is a 1988 Hong Kong martial arts-action comedy produced by Jackie Chan, directed by Wellson Chin Sing-Wai and starring Sibelle Hu, Ellen Chan and Sandra Ng. In common with many other Hong Kong films "The Inspector Wears Skirts" moves from genre to genre. Technically it is an action film with a high level of kung fu fighting, but it is also a romantic comedy that relies on slap-stick.', 'title': 'The Inspector Wears Skirts'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Welcome Home (Spanish: "Bienvenido a Casa" ) is a 2006 film written and directed by Spanish director David Trueba, about a young Madrid journalist named Samuel and his girlfriend Eva.', 'title': 'Welcome Home (2006 film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The Samuel Gardner House is a historic colonial American house at 1035 Gardner's Neck Road in Swansea, Massachusetts. This 1-1/2 story wood frame gambrel-roofed house was built c. 1768 by Samuel Gardner, whose father (also named Samuel) was the first English colonist to settle Gardner's Neck after its purchase from local Native Americans. It is a well-preserved 18th century farmhouse.", 'title': 'Samuel Gardner House'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Tom Ewell (born Samuel Yewell Tompkins, April 29, 1909 – September 12, 1994) was an American film, stage and television actor, and producer.', 'title': 'Tom Ewell'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Samuel Blair (June 14, 1712 – July 5, 1751) was one of the leaders of the Presbyterian New Light religious movement that swept the North American colonies as part of the First Great Awakening. In 1739, he founded a theology school, Faggs Manor Classical School, near his church in Faggs Manor, Pennsylvania. Blair's son, also named Samuel Blair was born in Faggs Manor, and became the second Chaplain of the United States House of Representatives. The church was rebuilt in 1846 and is now known simply as the Faggs Manor Presbyterian Church.", 'title': 'Samuel Blair (pastor)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Woods Runner is a 2010 young adult novel by Gary Paulsen that takes place during the year 1776. It is about a 13-year-old boy named Samuel living during the Revolutionary War whose house is burnt down by British soldiers. When Samuel investigates the scene of devastation, he finds dead bodies, but none of the bodies were his parents. The parents were not killed because one of the officer wanted somebody to play with in chess.Samuel starts a journey to find his parents in New York but gets hit in the head with a tomahawk and with the help of rebels is healed. Before Samuel finds his parents and is able to save them with the help of a man named Abner he saves a little girl named Annie and takes her with him on his journey. Samuel's family then adopts Annie as their own daughter. The novel ends by saying that Samuel decided to go to war but returned home after a man who had helped him earlier died.", 'title': 'Woods Runner'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Sarah Malinda Pritchard Blalock (March 10, 1839 or 1842, Avery County, North Carolina – March 9, 1901 or 1903, Watauga County, North Carolina) was a female soldier during the American Civil War. Despite originally being a sympathizer for the right of secession, she fought bravely on both sides. She followed her husband by joining the CSA's 26th North Carolina Regiment, disguising herself as a young male soldier named Samuel Blalock. The couple eventually escaped by crossing Confederate lines and joining the Union partisans in the mountains of western North Carolina. During the last years of the war, she was a pitiless pro-Union marauder, tormenting the Appalachia region. Today she's one of the most remembered female combatants of the Civil War.", 'title': 'Malinda Blalock'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Lieutenant Wore Skirts is a 1956 comedy film directed by Frank Tashlin and starring Tom Ewell, Sheree North, and Rita Moreno. It is a comedy about a man whose marriage begins to fail when his wife gets drafted.', 'title': 'The Lieutenant Wore Skirts'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Boston Beer Company is a brewer founded in 1984. Boston Beer Company's first brand of beer was named Samuel Adams (often shortened to Sam Adams) after Founding Father Samuel Adams, an American revolutionary patriot. The company launched Angry Orchard brand hard ciders in 2012.", 'title': 'Boston Beer Company'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Daredevil:Chinatown" is a five-issue "Daredevil" story arc under the All-New, All-Different Marvel title\' which was Written by Charles Soule, with art by Ron Garney. This series was collected in late 2015 and ended mid 2016. The story is split into 5 issues detailing Daredevil\'s return to New York in a new mostly black costume after he had erased the knowledge of his secret identity from everyone on the planet and taking in a new apprentice named Samuel Chung who takes on the identity Blindspot, and their fight against a new enemy called Tenfingers.', 'title': 'Daredevil: Chinatown'}]

