[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Eighth was a federal holiday in the United States from 1828 until 1861. It honored the Battle of New Orleans, which took place on January 8, 1815, with Tennessee\'s Andrew Jackson leading a successful battle against regular British soldiers and freed slaves. The holiday was celebrated widely across the US South after this final battle in the War of 1812. "The Eighth" became an official national holiday in 1828, following Jackson\'s election as President. The Eighth continued as an official national holiday from 1828 until the advent of the American Civil War.', 'title': 'The Eighth (United States)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Children's Day (こどもの日 , Kodomo no Hi ) is a Japanese national holiday which takes place annually on May 5, the fifth day of the fifth month, and is the final celebration in Golden Week. It is a day set aside to respect children's personalities and to celebrate their happiness. It was designated a national holiday by the Japanese government in 1948. It has been a day of celebration in Japan since ancient times.", 'title': "Children's Day (Japan)"}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Koningsdag (] ) or King's Day is a national holiday in the Kingdom of the Netherlands. Celebrated on 27 April (26 April if the 27th is a Sunday), the date marks the birth of King Willem-Alexander.", 'title': 'Koningsdag'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'White Sunday is a national holiday in Samoa falling on the second Sunday of October, with the Monday following a public holiday. It is a day for parents and communities to acknowledge and celebrate childhood by hosting special programs during church services which include scriptural recitations. Biblical story reenactments, and creative dance performances. Children receive gifts (often new clothing and/or school supplies) on White Sunday and are allowed privileges normally reserved for elders, such as being the first to be served food at family meal time.', 'title': 'White Sunday'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': "Oranjegekte (Orange craze) or Oranjekoorts (Orange fever) is a phenomenon in the Netherlands that occurs during major sporting events, especially international football championships, and during Koningsdag, an annual holiday celebrating the king's birthday. It manifests itself in the wearing of orange clothing such as T-shirts, caps and scarfs; lavish attention for sports and sports fans in the media; and the decoration of cars, rooms, houses, shops, and even entire streets in orange, the traditional color of the Dutch royal family, the House of Orange-Nassau.", 'title': 'Oranjegekte'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Queen\'s Day or "Koninginnedag" is the former name of a national holiday in the Netherlands, the Netherlands Antilles and Aruba from 1890 to 2013. It has since been renamed King\'s Day or "Koningsdag" to honor the birthday of King Willem-Alexander.', 'title': "Queen's Day (disambiguation)"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Garifuna Settlement Day is a public holiday in Belize, celebrated each year on November 19. The holiday was created by Belizean civil rights activist, Thomas Vincent Ramos, in 1941. It was recognized as a public holiday in the southern districts of Belize in 1943, and declared a national holiday in 1977. The holiday celebrates the settlement of the Garifuna people in Belize after being exiled from the Grenadines by the British army. The major festivities for the holiday occur in the town of Dangriga, including parades, street music, and traditional dancing.', 'title': 'Garifuna Settlement Day'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Saint-Jean-Baptiste Day (French: "Fête de la Saint-Jean-Baptiste" ), officially known in Quebec as the National Holiday, (French: "la fête nationale" ) is a holiday celebrated annually on June 24, the feast day of the Nativity of St. John the Baptist. In Quebec, it is a public holiday with festivities occurring on June 23 and 24 which are publicly financed and organized by a "Comité organisateur de la fête nationale" (National Holiday Organizing Committee). June 24 is also celebrated as a festival of French Canadian culture in other Canadian provinces and the United States.', 'title': 'Saint-Jean-Baptiste Day'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Jounen Kwéyòl (Creole Day) is celebrated in Saint Lucia on the last Sunday of October across the entire island, and has been held annually since 1984. On the Sunday of this week, the various towns chosen to host this festival put out the result of their grand preparations; local dishes and foods such as roast breadfruit, Green Fig and Salt Fish (The National Dish of Saint Lucia), plantain, king fish, Manicou (opossum), Souse (a soup made with pork and often cucumber), fried bake and floats, Accra (a fried dough which contains salt fish), Paime (otherwise known as Conkies) and a famous dish known as Bouillon (fish, chicken or meat stewed with dasheen, yams, plantains, banana and dumplings) Also local drinks such as Cocoa Tea, Golden Apple Juice, Guava Juice and more. Apart from the food part, the event is collaborated with kweyol music some of which have been past down to and from many generations. The most widely used instrument besides vocals are the Tambos (drums) and are beaten throughout as people speak in the creole language and have a merry time. Most people commemorate this day by wearing the island's National Wear such as the Wob Dwiete. Persons who do not want to wear the extreme layers of skirts and dresses make clothing out of special plaid material called Madras which is one of the cloths used in the national wear. Among the places which celebrate it every year are Mon Repos and Dennery.", 'title': 'Jounen Kwéyòl'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Christmas in the Basque Country starts with the of Santo Tomas on 21 December, a celebration in which most people go out onto the streets to dance and eat talo with txistorra (a type of Basque chorizo). They wear a traditional outfit called the casera dress. For girls it consists of a long skirt and a long-sleeved old-fashioned shirt with headscarves and aprons. The boys wear a long black shirt, trousers and txapela (traditional black beret). The casera outfits are normally dark blue, but can come in many colors. They wear caseras because that is what the people of the mountain wear and the holiday used to celebrate the peasants who sold their goods in town and came on Santo Tomas to pay rent to landlords in the city.', 'title': 'Christmas in the Basque Country'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Henry James "Jim" Nape Bartels (July 25, 1945 – April 20, 2003) was a Hawaiian museum curator and historian, who was the curator of ʻIolani Palace and later Washington Place.', 'title': 'Jim Bartels'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Building typology refers to the study and documentation of a set of buildings which have similarities in their type of function or form. There are two ways of looking at the term "building typology". The first is a functional typology that categorizes buildings into groups by the similarity of their use. A functional building typology under this definition may create groups such as hospitals, schools, and shopping centers (see more examples in the list of building types by use). The second is a typology that groups buildings according to their forms, which is explained is this article. Formal building typology may be based on configuration, format, or relationships of building to streets and each other. Any single functional type can be subdivided into formal types. For example, the residential functional type may be further subdivided into formal categories such as high rise towers, single family homes, duplexes, and townhouses. The townhouse building is one formal type that has a specific configuration: single units are placed side-by-side with others, vertically oriented up to four stories tall, and facing the street. Many more variations of this formal type are found around the world, each with variations that are the result of local materials, cultural habits, age and technology. Documenting a type is the process of discovering the elements of similar forms which are the same. Usually building types are distinguished by their basic form, site configuration, and scale, but not their specific architectural style, color, or even precise use.and are related to the era, the culture, and the environment in which they arise.', 'title': 'Building typology'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "The ʻ Iolani Palace was the royal residence of the rulers of the Kingdom of Hawaii beginning with Kamehameha III under the Kamehameha Dynasty (1845) and ending with Queen Liliʻuokalani (1893) under the Kalākaua Dynasty, founded by her brother, King David Kalākaua. It is located in the capitol district of downtown Honolulu in the U.S. state of Hawaiʻ i. It is now a National Historic Landmark listed on the National Register of Historic Places. After the monarchy was overthrown in 1893, the building was used as the capitol building for the Provisional Government, Republic, Territory, and State of Hawaiʻ i until 1969. The palace was restored and opened to the public as a museum in 1978. The 'Iolani Palace is the only royal palace on US soil.", 'title': 'ʻIolani Palace'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Škoda Palace is the current site of the Prague Town Hall. The late Art Deco building in Jungmannova Street was built in 1929 for the Škoda company using a design by the prominent architect Pavel Janák (Adria Palace, Czernin Palace). The adjacent office building in Charvátova Street dates back to 1937. Even today, both buildings still satisfy the strictest requirements thanks to their flexible arrangement of office and common space within the buildings. The buildings are accessible through several entrances, which allows the interiors to be easily divided into independent sections. The Palace served as the headquarters of the ČEZ Energy Group from 1994 to 2004.', 'title': 'Škoda Palace'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'German submarine "U-139" was a Type IID U-boat of Nazi Germany\'s "Kriegsmarine" during World War II. Her keel was laid down on 20 November 1939 by Deutsche Werke in Kiel as yard number 268. She was launched on 28 July 1940 and commissioned on 24 July 1940 with "Kapitänleutnant" Robert Bartels in command.', 'title': 'German submarine U-139 (1940)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The Guitar and Lute Workshop (GLW) was a manufacturer of custom guitars, ukuleles, and period stringed instruments based in Honolulu, Hawaii between 1970 and 1976. The workshop was known primarily for the talented luthiers employed in either construction of guitars, or the musicians that taught at the workshop or that used guitars made at the workshop. Additionally, an independent piano restoration and tuning business operated above the workshop floor and studios for at least two years. The GLW was notable as a nexus of activity supporting native Hawaiian musical cultural discovery during the Second Hawaiian Renaissance of the 1970s, with key Hawaiian musicians such as Keola Beamer and Kapono Beamer gaining starts in their careers at the GLW, as well as musical instrument restoration for instruments of Hawaiian royalty (of the Kingdom of Hawaii), now curated by ʻIolani Palace. Additionally, the GLW's focus on traditional period stringed instruments was, in part, responsible for the resurgent interest in the viol and traditional luthierie methods within the western United States in the early 1970s.", 'title': 'Guitar and Lute Workshop'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Grandmaster\'s Palace (Maltese: "Il-Palazz tal-Granmastru" ), officially known as The Palace (Maltese: "Il-Palazz" ), is a palace in Valletta, Malta. It was built between the 16th and 18th centuries as the palace of the Grand Master of the Order of St. John, who ruled Malta, and was also known as the Magisterial Palace (Maltese: "Palazz Maġisterjali" ). It eventually became the Governor\'s Palace (Maltese: "Palazz tal-Gvernatur" ), and it currently houses the Office of the President of Malta. Parts of the building, namely the Palace State Rooms and the Palace Armoury, are open to the public as a museum run by Heritage Malta.', 'title': "Grandmaster's Palace (Valletta)"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Kathleen S. Bartels is the current director of the Vancouver Art Gallery in Vancouver, BC. Since 2001, Bartels’ direction has guided the Gallery’s growth in its arts programs and exhibitions. She is also leading the Gallery’s current initiative to build a new and expanded building.', 'title': 'Kathleen S. Bartels'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'German submarine "U-197" was a Type IXD2 U-boat of Nazi Germany\'s "Kriegsmarine" during World War II. The submarine was laid down on 5 July 1941 at the DeSchiMAG AG Weser yard in Bremen as yard number 1043. She was launched on 21 May 1942, and commissioned on 10 October under the command of "Korvettenkapitän" Robert Bartels. After training with the 4th U-boat Flotilla at Stettin, "U-197" was transferred to the 12th U-boat Flotilla for front-line service on 1 April 1943.', 'title': 'German submarine U-197'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Main Post Office Building in Belgrade is located on the corner of Takovska Street and Boulevard of Kralj Aleksandar, close to the National Assembly, the building of the President of Serbia (the building of the New Palace) and the Belgrade City Assembly (the building of the Old Palace). It is one of the most representative buildings of the most important state institution for postal traffic and services. It was constructed in the period from 1935 to 1938 as the palace of the Post Office Savings Bank, the Main Post Office and the Main Telegraph. Since the completion of the work to date, the part of the palace from Takovska Street designed for the work of the Main Post Office has not changed its basic purpose. On the other hand, the part of the palace from Boulevard of Kralj Aleksandar in which the Post Office Savings Bank was located, from 1946 to September 2006, was used to house the National Bank until its relocation to a new facility on Slavija Square. Since 2003, some ministries of the Republic of Serbia were located in this building, and since 2013, it is used by the Constitutional Court of Serbia. The same year, in 2013, the Palace of the Main Post Office was declared a cultural monument.', 'title': 'General Post Office, Belgrade'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Leeds Guide was a monthly "What\'s on" magazine published in Leeds, West Yorkshire, England from 1997 until 2012. It was the longest established \'What\'s on\' magazine for Leeds. Originally a monthly A5 magazine printed in black and white, "The Leeds Guide" changed to an A4 fortnightly in 2003 and subsequently went back to being published monthly.', 'title': 'The Leeds Guide'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Frank Legato is an American author born in 1956 in Pittsburgh, PA. He is best known for his book "How to Win Millions Playing Slot Machines...or Lose Trying". He is also well known for founding and editing "Casino Gaming" magazine and writing a monthly humorous column about slot machines for "Strictly Slots" magazine.', 'title': 'Frank Legato'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Sylph (シルフ , Shirufu ) is a Japanese shōjo manga magazine published by ASCII Media Works (formerly MediaWorks) and is sold monthly. The magazine was originally published on December 9, 2006 as a special edition version of MediaWorks\' now-defunct "Dengeki Comic Gao! " under the title "Comic Sylph" (コミックシルフ , Komikku Shirufu , normally written as "comic SYLPH") as a quarterly publication. On March 21, 2008, with the release of the sixth volume, the magazine was transferred over as a special edition version of ASCII Media Works\' shōnen manga magazine "Dengeki Daioh". On May 22, 2008, the magazine became independent of "Dengeki Daioh" and was published as volume one of "Sylph" as the July 2008 issue as a bimonthly publication. On May 22, 2010, the magazine started to be published monthly. "Sylph" is one of the few magazines originally published by MediaWorks not under the "Dengeki" naming line, such as with "Dengeki Daioh", and "Dengeki G\'s Magazine", the first of which being "Active Japan" in 1995 which has been discontinued since 1998.', 'title': 'Sylph (magazine)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Strictly Slots is a monthly magazine aimed at slot machine and video poker players. The magazine was founded in 1998. Strictly Slots is published by the Casino Player Publishing, which also publishes "Casino Player" magazine. The magazine include articles about the following: history of slot machine, the principle of slot machine work, new strategies for playing video poker, casino reviews and latest casino news etc. It features regular articles from notable gambling authors, including:', 'title': 'Strictly Slots'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Newport Life Magazine is a lifestyles magazine based in Newport, Rhode Island. Founded in 1993, the magazine is published eight times annually and covers the events, people, history and places of Newport County. Newport Life Magazine is located at 101 Malbone Road in the Newport Daily News building. The magazine is published bi-monthly. Issues include: Jan/Feb, March/April, May/June, July, August, Sept/Oct and Nov/Dec.', 'title': 'Newport Life Magazine'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Dengeki G\'s Comic (電撃G\'sコミック , Dengeki Jīzu Komikku ) is a Japanese seinen manga magazine published by ASCII Media Works. The magazine was first published digitally on August 9, 2012 with volume 0, and started monthly publication with the following issue released on October 15, 2012. From April 2013 to April 2014, the magazine was released biweekly. "Dengeki G\'s Comic" began to be published monthly in print with the June 2014 issue sold on April 30, 2014.', 'title': "Dengeki G's Comic"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Great Lakes Life Magazine was a regional magazine that was published in Westfield, New York. It was founded by editor-in-chief and publisher Rena Tran and began publication in February 2008 under the title Erie Life Magazine, but went out of production in 2011. The magazine was available in over 750 retail locations in Pennsylvania, Ohio, western New York, eastern Michigan, and southern Ontario and circulated to over 25,000 readers.', 'title': 'Great Lakes Life Magazine'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Sekai (Japanese: 世界 "World") is a Japanese monthly political magazine published by Iwanami Shoten, which was founded in December 1945. The first issue was published in 1946. The magazine is published monthly. It has a left-wing or progressive political stance. The magazine\'s founding principles were "peace and social justice, freedom and equality, and harmony and solidarity with the peoples of East Asia." The headquarters is in Tokyo. Yamaguchi Akio served as an editor of the magazine for a long period.', 'title': 'Sekai (magazine)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Manga Life (まんがライフ , Manga Raifu ) is a manga magazine published monthly by Takeshobo in Japan since the November 1984 issue (published in October 1984). Its original title was Gag da (ギャグダ , Gyagu da ) , and the change to "Manga Life" was made to better compete with "Manga Time", a rival magazine published by Houbunsha. Most of the series appearing in the magazine use the yonkoma format. The magazine is released monthly on the 17th, though it sometimes appears on shelves slightly before or after that, depending on speed of actual distribution. "Manga Life" is published in B5 size, and its Japanese magazine code is 18635.', 'title': 'Manga Life'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Life was an American magazine that ran weekly from 1883 to 1936 as a humor magazine with limited circulation. " Time" owner Henry Luce bought the magazine in 1936, solely so that he could acquire the rights to its name, and launched a major weekly news magazine with a strong emphasis on photojournalism. "Life" was published weekly until 1972, as an intermittent "special" until 1978, and as a monthly from 1978 to 2000.', 'title': 'Life (magazine)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Racecourse Ground Promenade was a cricket ground in Northampton, Northamptonshire, situated within what was Northampton Racecourse. The first recorded match on the ground was in 1844, when the Gentlemen of the North played the Gentlemen of the South. The ground held its only first-class match in 1872 when a United North of England Eleven played a United South of England Eleven. The ground held its final recorded match in 1885 when Northamptonshire played Warwickshire.', 'title': 'Racecourse Ground Promenade'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Frederic Dudley North CMG (9 November 1866 – 22 August 1921) was an English-born public servant and sportsman. A descendant of the Barons North, he attended Rugby School before emigrating to Western Australia in 1886. North played two first-class matches for Western Australia, and was also involved in cricket administration, serving as the first secretary of the Western Australian Cricket Association (WACA). Outside of cricket, North worked as a public servant, filling various roles in the Western Australian government, including secretary to Sir John Forrest, the first Premier of Western Australia, and head Colonial Secretary's Department. He was also Mayor of Cottesloe between 1906 and 1907 and again from 1911 to 1916. North died in Cottesloe from a heart attack in 1921, at the age of 54.", 'title': 'Frederic North'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Tyler's Ground (also known as Tyler's Meadow) was a cricket ground in Loughborough, Leicestershire. It is believed the ground was located along Allsop's Lane on the edge of the town, with the ground being described as located a short distance from Loughborough railway station. The first recorded match played at the ground was in 1856, when Loughborough played an All-England Eleven. A single first-class match was played at the ground in 1875, when the North played the South, with W. G. Grace taking nine wickets in the North's first-innings and William Mycroft taking six wickets in the South's first-innings. Grace then took five wickets in the North's second-innings, ending with match figures of 14/108, while Mycroft took eight wickets in the South's second-innings to finish with match figures of 14/38. No batsman passed 26 runs, with the highest innings score being 130 in the North's second-innings. The match ended in a victory by 125 runs for the North. No further matches are recorded as being played at the ground following this date and its location is today agricultural fields.", 'title': "Tyler's Ground"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Eustace Herbert Guest North (4 November 1868 – 17 March 1925) was an English international rugby union forward who played club rugby for Oxford University and Blackheath. North played international rugby for England and was an original member of invitational team, the Barbarians.', 'title': 'Eustace North'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Barker's Ground was a cricket ground in Leicester, Leicestershire. The first recorded match on the ground was in 1825, when Leicester played Sheffield. The first first-class match came in 1836, when the North played the South; the South won by 218 runs, largely due to Alfred Mynn's two not out innings. The North used the ground for 4 further first-class matches up to 1846, including the ground's final first-class match between the North and the Marylebone Cricket Club. Midland Counties played a single first-class match at Barker's Ground against the Marylebone Cricket Club in 1843. The final recorded match on the ground saw Leicestershire play an All-England Eleven in 1860.", 'title': "Barker's Ground"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The North of England and South of England cricket teams appeared in first-class cricket between the 1836 and 1961 seasons, most often in matches against each other but also individually in games against touring teams, Marylebone Cricket Club (MCC) and others. Until international cricket became firmly established towards the end of the 19th century, the North v South match was one of the major fixtures in the cricketing calendar along with Gentlemen v Players. Indeed it was really "the" major fixture because whereas the Gentlemen teams were often very weak, North v South could potentially showcase the best 22 players in the country. In all, the North played against the South 155 times in first-class matches.', 'title': 'North v South'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Young Justice is an American animated television series created by Brandon Vietti and Greg Weisman for Cartoon Network. Despite its title, it is not a direct adaptation of Peter David, Todd Dezago and Todd Nauck\'s "Young Justice" comic series, but rather an adaptation of the entire DC Universe with a focus on young superheroes.', 'title': 'Young Justice (TV series)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Gerard Christopher (born Jerry DiNome in New York City on May 11, 1959) is an American actor. He was the second actor to play the role of "Superboy" in the series of the same name (1989–1992). During his tenure on "Superboy" he would later also be a producer and writer on the series. He has performed in a number of telemovies, and was a guest star on daytime soap operas such as "Days of Our Lives" and "Sunset Beach", and the prime time soap opera "Melrose Place". He has also starred in the comedy movie "Tomboy" (1985).', 'title': 'Gerard Christopher'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Nolan Ramsey North (born October 31, 1970) is an American actor and voice actor. His voice work includes characters such as Nathan Drake from the "Uncharted" series, Desmond Miles from the "Assassin\'s Creed" video game series, Ghost from Bungie\'s titles "Destiny" and "Destiny 2", the Penguin in the "" video game franchise, Meepo the Geomancer in "Dota 2", Cpt. Martin Walker in "", David in "The Last of Us", several characters in various pieces of Marvel media (most popularly Deadpool), Superboy in "Young Justice", himself and one of the possible voice choices for the Boss in "Saints Row IV", and Edward Richtofen in the "Call of Duty" Zombies storyline.', 'title': 'Nolan North'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Burton-on-Trent Cricket Ground (exact name unknown) was a cricket ground in Burton-on-Trent, Staffordshire. The first recorded match on the ground was in 1840, when the North played the Marylebone Cricket Club in the grounds first first-class match. The following year the ground held its second and final first-class match when the North again played the Marlybone Cricket Club.', 'title': 'Burton-on-Trent Cricket Ground'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Plastic optical fiber (POF) (or Polymer optical fibre) is an optical fiber that is made out of polymer. Similar to glass optical fiber, POF transmits light (for illumination or data) through the core of the fiber. Its chief advantage over the glass product, other aspect being equal, is its robustness under bending and stretching. Optical fiber used in telecommunications is governed by European Standards EN 60793-2-40-2011.', 'title': 'Plastic optical fiber'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'An optical fiber connector terminates the end of an optical fiber, and enables quicker connection and disconnection than splicing. The connectors mechanically couple and align the cores of fibers so light can pass. Better connectors lose very little light due to reflection or misalignment of the fibers. In all, about 100 fiber optic connectors have been introduced to the market.', 'title': 'Optical fiber connector'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Fiber optic filter is an optical fiber instrument used for wavelength selection, which can select desired wavelengths to pass and reject the others. It is Widely used in DWDM systems dynamic wavelength selection, DWDM signal separation, optical performance monitoring, field tunable optical noise filtering and optical amplifier noise suppression, etc. Optical multiplexers (couplers) makes different wavelength coupling into an optical fiber and different wavelength carries different information. At the receiving end, if you want to separate desired wavelengths from optical fiber, it is necessary to use optical filter.', 'title': 'Fiber optic filter'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'TOSLINK (from "Toshiba Link") is a standardized optical fiber connector system. Also known generically as an "optical audio cable" or just "optical cable", its most common use is in consumer audio equipment (via a "digital optical" socket), where it carries a digital audio stream from components such as CD and DVD players, DAT recorders, computers, and modern video game consoles, to an AV receiver that can decode two channels of uncompressed lossless PCM audio or compressed 5.1/7.1 surround sound such as Dolby Digital Plus or DTS-HD High Resolution Audio. Unlike HDMI, TOSLINK does not have the bandwidth to carry the lossless versions of Dolby TrueHD, DTS-HD Master Audio, or more than two channels of PCM audio.', 'title': 'TOSLINK'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'A cleave in an optical fiber is a deliberate, controlled break, intended to create a perfectly flat endface, perpendicular to the longitudinal axis of the fiber. The process of cleaving an optical fiber forms one of the steps in the preparation for a fiber splice operation regardless of the subsequent splice being a fusion splice or a mechanical splice; the other steps in the preparation being those of stripping and fiber alignment. A good cleave is required for a successful low loss splice of an optical fiber, often it is the case that fibers spliced by identical methods tend to have different losses, this difference can often be attributed to the quality of their initial cleaves.', 'title': 'Cleave (fiber)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'A fiber optic splitter, also known as a beam splitter, is based on a quartz substrate of an integrated waveguide optical power distribution device, similar to a coaxial cable transmission system. The optical network system uses an optical signal coupled to the branch distribution. The fiber optic splitter is one of the most important passive devices in the optical fiber link. It is an optical fiber tandem device with many input and output terminals, especially applicable to a passive optical network (EPON, GPON, BPON, FTTX, FTTH etc.) to connect the MDF and the terminal equipment and to branch the optical signal.', 'title': 'Fiber optic splitter'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'S/PDIF (Sony/Philips Digital Interface Format) is a type of digital audio interconnect used in consumer audio equipment to output audio over reasonably short distances. The signal is transmitted over either a coaxial cable with RCA connectors or a fibre optic cable with TOSLINK connectors. S/PDIF interconnects components in home theatres and other digital high-fidelity systems.', 'title': 'S/PDIF'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The FC connector is a fiber-optic connector with a threaded body, which was designed for use in high-vibration environments. It is commonly used with both single-mode optical fiber and polarization-maintaining optical fiber. FC connectors are used in datacom, telecommunications, measurement equipment, and single-mode lasers. They are becoming less common, displaced by SC and LC connectors. The FC connector has been standardized in TIA fiber optic connector intermateability standard EIA/TIA-604-4.', 'title': 'FC connector'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "In fiber-optic communication, a single-mode optical fiber (SMF) is an optical fiber designed to carry light only directly down the fiber - the transverse mode. Modes are the possible solutions of the Helmholtz equation for waves, which is obtained by combining Maxwell's equations and the boundary conditions. These modes define the way the wave travels through space, i.e. how the wave is distributed in space. Waves can have the same mode but have different frequencies. This is the case in single-mode fibers, where we can have waves with different frequencies, but of the same mode, which means that they are distributed in space in the same way, and that gives us a single ray of light. Although the ray travels parallel to the length of the fiber, it is often called transverse mode since its electromagnetic oscillations occur perpendicular (transverse) to the length of the fiber. The 2009 Nobel Prize in Physics was awarded to Charles K. Kao for his theoretical work on the single-mode optical fiber.", 'title': 'Single-mode optical fiber'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The Telecommunications Industry Association's TIA-598-C Optical Fiber Cable Color Coding, is an American National Standard, that provides all necessary information for color-coding optical fiber cables in a uniform manner. It defines identification schemes for fibers, buffered fibers, fiber units, and groups of fiber units within outside plant and premises optical fiber cables. This standard allows for fiber units to be identified by means of a printed legend. This method can be used for identification of fiber ribbons and fiber subunits. The legend will contain a corresponding printed numerical position number and/or color for use in identification.", 'title': 'TIA-598-C'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Heavy Seas Beer is brewed by Clipper City Brewing Company, in Baltimore, Maryland. The brewery was established by Hugh Sisson in 1995. Previously, Sisson operated Maryland's first brewpub, Sisson's. In 2010, the brewery rebranded. While the name of the company remains Clipper City Brewing Company, all of its beer falls under the Heavy Seas brand. Heavy Seas hosts tours on most weekends. It is located at 4615 Hollins Ferry Road, Suite B, in the Halethorpe section of Baltimore. Heavy Seas currently offers a variety of beer styles in approx. 18 states within the United States. Several Heavy Seas beers have been awarded and include the following: Cutlass Amber Lager (a repeat medal winner at the Great American Beer Festival from 2006-2010, bronze medal winner at the 2010 World Beer Cup and silver medal winner at the 2012 World Beer Cup as Heavy Seas Märzen), Powder Monkey Pale Ale (silver medal winner at the 2008 Great American Beer Festival and bronze medal winner at the 2010 World Beer Cup as Heavy Seas Pale Ale), Small Craft Warning Uber Pils (bronze medal winner at the 2004 Great American Beer Festival), Gold Ale (gold medal winner at the 2010 World Beer Cup, bronze medal winner at the 2010 Great American Beer Festival and bronze medal winner at the 2014 Great American Beer Festival as Heavy Seas Gold Ale) and Winter Storm Imperial ESB (gold medal winner at the 2008 World Beer Cup).", 'title': 'Heavy Seas Beer'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Blue Mountain Brewery in Afton, Virginia is a brewery which forms, along with Starr Hill Brewery, South Street Brewery, Wild Wolf Brewing Company and Devils Backbone Brewing Company, an integral part of the Brew Ridge Trail. Blue Mountain was the first brewery to open in Nelson County. They cultivate 1/3 acre of mainly Cascade-variety hops. One of their seasonal beers, Blue Reserve, took home the first-ever medal (Silver) for a beer hopped solely with Virginia hops at the world's largest beer competition, the Great American Beer Festival, in 2011 for the American-Belgo Ale category. Blue Mountain is also the only Virginia brewery to hold back-to-back Gold medals at the 2010 and 2011 Great American Beer Festival. In 2012, a new sister brewery, Blue Mountain Barrel House, was opened by two of the founders of the original Blue Mountain Brewery.", 'title': 'Blue Mountain Brewery'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Genesee Valley Park is located in the south side of Rochester, New York along the shores of the Genesee River. The New York State Barge Canal (the currently in-use portion of the Erie Canal) crosses the Genesee River within the park. The University of Rochester is located near the park's north entrance.", 'title': 'Genesee Valley Park'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Pipeworks Brewing Company is a brewery in Chicago, Illinois. The brewery opened in January 2012 by founders Beejay Oslon and Gerrit Lewis. Pipeworks began their brewing different from other microbreweries in that they initially brewed their beers entirely as a series of 'one off' beers that were aimed specifically to the niche market of beer connoisseurs. The brewery's stated goal is to release a new beer every week. This approach gave the brewery and its beers somewhat of a cult status among beer enthusiasts, with its offerings selling out relatively quickly. After seeing significant growth, both in output brand and identity, Pipeworks has since augmented their one-off beers with several of its 'core' beers in 16 ounce can 4-Packs now regularly available widley throughout the Chicago area.", 'title': 'Pipeworks Brewing'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Genesee Brewing Company is an American brewery located along the Genesee River in Rochester, New York. In 1878, Genesee Brewing Company moved up into Rochester. From 2000 to 2009, the company was known as the High Falls Brewing Company. In 2009, High Falls was acquired by the capital investment firm KPS Capital. Together with also newly acquired Labatt USA, KPS merged the two companies as North American Breweries. Along with this change, High Falls Brewery changed its name back to the original "Genesee Brewing Company" operating under the North American Breweries name. In October 2012, North American Breweries was purchased by FIFCO', 'title': 'Genesee Brewing Company'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Genny Light is an American light beer that is produced by the Genesee Brewing Company which is based in Rochester, New York. It was launched in 1978. The beer has 4.0% alcohol volume and 100 calories per 12 ounce portion.', 'title': 'Genny Light'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Pabst Brewing Company ( ) is an American company that dates its origins to a brewing company founded in 1844 by Jacob Best and was, by 1889, named after Frederick Pabst. It is currently the holding company contracting for the brewing of over two dozen brands of beer and malt liquor from now defunct companies including Pabst Blue Ribbon, P. Ballantine and Sons Brewing Company, G. Heileman Brewing Company, Lone Star Brewing Company, Pearl Brewing Company, Piels Bros., Valentin Blatz Brewing Company, National Brewing Company, Olympia Brewing Company, Falstaff Brewing Corporation, Primo Brewing & Malting Company, Rainier Brewing Company, F & M Schaefer Brewing Company, Joseph Schlitz Brewing Company, Jacob Schmidt Brewing Company and Stroh Brewery Company.', 'title': 'Pabst Brewing Company'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Riverton, New York was a planned community built in 1973 in the town of Henrietta, New York, along the Genesee River. Riverton was seventh of the thirteen communities receiving Federal guarantee assistance from HUD as part of their New Communities Program created by the Urban Growth and New Community Development Act of 1970. $12 million was earmarked for the community. Riverton was supposed to encompass a 2335 acre land area bordered on the north by the New York State Thruway, on the west by the Genesee River, on the east by East River Rd., and on the south by the Rush-Henrietta town line, with some development continuing east along Erie Station Rd. Original plans called for construction to occur for a 16-year period and eventually house over 25,000 people, with the community including an 18-hole golf course, 12 swimming pools, 3 artificial lakes, a marina on the Genesee, and commercial and industrial centers. However, only a small portion of this was built along Scottsville-West Henrietta Rd. Created as part of the community were Riverton Knolls, a moderately priced townhouse subdivision, the Riverton Golf Club, a small 9-hole golf course, and the Riverton Park, which included a playground, baseball diamond, river front benches, walking trail, and a volleyball court. Also nestled in a bend in the Genesee was a 28 acre forested nature park.', 'title': 'Riverton, New York'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Heineken Light (labelled as "Heineken 3" in Australia ) is a light beer brewed by Heineken for the United States market. It was introduced in 2005. Heineken light reportedly has: 99 calories per 12 oz. bottle and 6.8\xa0grams of carbohydrates. The beer has fewer calories, less carbohydrate, and less alcohol than lager beers such as the Heineken Pilsener. The beer has 3.3% alcohol by volume.', 'title': 'Heineken Premium Light'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Enviga is a Nestea carbonated canned green-tea drink. Enviga is a trademark of Nestlé licensed to Beverage Partners Worldwide, a joint-venture between The Coca-Cola Company and Nestlé. It is available in three flavors: Green Tea, Tropical Pomegranate, and Mixed Berry. According to Coca-Cola, Enviga burns 60 to 100 calories per three 12-oz. (330 ml) cans due to its high EGCG and caffeine content. This is disputed by some researchers and public advocates.', 'title': 'Enviga'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "SM-Chile is a holding company for Banco de Chile. Until 1996, when its Board of Shareholders agreed to become an investment company with exclusive turn, governed by Law No. 19,396, changing its name to Bank of Parent Company Chile SA' Simultaneously, the parent company of Banco de Chile SA created a commercial bank under the name Banco de Chile and was transferred all its assets and liabilities, excluding subordinated obligation call with the Central Bank of Chile, obligation undertaken following the banking crisis of the years 1982 - 1984 and the consequent bailout carried out by the Central Bank. After this transformation, the sole shareholder of Banco de Chile was the parent company of Banco de Chile SA", 'title': 'SM-Chile'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Vedanta Resources plc is a global diversified metals and mining company with its headquarters in London, United Kingdom. It is the largest mining and non-ferrous metals company in India and has mining operations in Australia and Zambia and oil and gas operations in three countries. Its main products are copper, zinc, aluminium, lead, iron ore and petroleum. It is also developing commercial power stations in India in Odisha (2,400 MW) and Punjab (1,980 MW). The company is principally owned by Indian billionaire Anil Agarwal through Volcan Investments, a holding vehicle with a 61.7% stake in the business.', 'title': 'Vedanta Resources'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'A parent company guarantee (PCG) is a guarantee by a parent company of a contractor’s performance under its contract with its client, where the contractor is a subsidiary of the parent company.', 'title': 'Parent company guarantee'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Ta Ching Motor Co. (TCMC) was a Taiwanese automotive manufacturer between 1986 and 2002. Headquartered in Pingtung City, it was the official procuration dealer of the Japanese Subaru motor brand in Taiwan. Its main shareholders included Taiwan Vespa Co., Ltd, and the parent company of the Subaru brand, Fuji Heavy Industries. The annual production in the 1990s was 20,000 per year, but quickly scaled down to 1,713 in the year 2001. Fuji Heavy Industries tried to obtain the sales and production of Taiwan-made Subaru vehicles on their own, but failed to increase sales. The cooperation between TCMC and Fuji Heavy Industries ended in 2002 when Ta Ching Motor Co. went defunct.', 'title': 'Ta Ching Motor Co.'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Charlie the Tuna is the cartoon mascot and spokes-tuna for the StarKist brand. He was created in 1961 by Tom Rogers of the Leo Burnett Agency after StarKist hired Leo Burnett in 1958. StarKist Tuna is the name of a brand of tuna currently owned by Dongwon Industries, a South Korea-based conglomerate. StarKist itself is based in Pittsburgh, the home of its former parent company, H. J. Heinz Company, sharing its headquarters on the site of Three Rivers Stadium with another former parent company, Del Monte Foods' Pittsburgh headquarters.", 'title': 'Charlie the Tuna'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Hainan HNA Infrastructure Investment Group Co., Ltd. formerly Hainan Island Construction Co., Ltd. is a Chinese listed company based in Haikou. in mid-2016 the company acquired HNA Infrastructure Group () in a reverse IPO from intermediate parent company HNA Infrastructure Holding Group (), which HNA Infrastructure Group is the parent company of HNA Real Estate and HNA Airport Group (, in turn HNA Airport Group is the parent company of HNA Airport Holdings (Group) () and HNA Airport Holdings is the parent company of Sanya Phoenix International Airport Co., Ltd.); HNA Airport Group is the largest shareholder of Haikou Meilan International Airport (19.58% as at October 2016), which in turn the largest shareholder of Hong Kong listed company HNA Infrastructure. In December 2016 a proposed capital increase of the HK-listed company was announced. HNA Infrastructure Investment Group would purchase a minority share directly. Haikou Meilan International Airport was the second-largest shareholder of Hainan Airlines; Hainan Airlines, however, also owned a minority stake in Haikou Meilan International Airport.', 'title': 'HNA Infrastructure Investment Group'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Aspen Technology, Inc. -- known as AspenTech -- is a provider of software and services for the process industries headquartered in Bedford, Massachusetts. AspenTech has 30 offices around the world, on 6 continents.', 'title': 'Aspen Technology'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Sterlite Industries (India) Ltd. is a subsidiary of Vedanta Resources plc, a diversified and integrated metals and mining group. The company is based in Mumbai, India. On 31 March 2013, the company's market capitalisation was INR 31,490 crores (US$ 5.79 billion). <br>", 'title': 'Sterlite Industries'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Reliance Jio Infocomm Limited, or Jio, is an LTE mobile network operator in India. It is a wholly owned subsidiary of Reliance Industries headquartered in Navi Mumbai, Maharashtra that provides wireless 4G LTE service network (without 2G/3G based services) and is the only 'VoLTE-only' (Voice over LTE) operator in the country which lacks legacy network support of 2G and 3G, with coverage across all 22 telecom circles in India.", 'title': 'Jio'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Life-Like was a manufacturer of model trains and accessories that began as a division of parent company Life-Like Products, a manufacturer of extruded foam ice chests and coolers. In 1960 the company purchased the assets of the defunct Varney Scale Models and began manufacturing model trains and accessories under the name Life-Like in 1970. In 2005 the parent company, known as Lifoam Industries, LLC, chose to concentrate on their core products and sold their model railroad operations to hobby distributor Wm. K. Walthers. Today, the Life-Like trademark is used by Walthers for its line of value-priced starter train sets.', 'title': 'Life-Like'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'WhoCares, full title Ian Gillan & Tony Iommi: WhoCares is a music project by Deep Purple frontman Ian Gillan and Black Sabbath guitarist Tony Iommi and a charity release by the supergroup WhoCares they had formed with the help of other musicians, to raise money to rebuild a music school in Gyumri, Armenia after the destruction of the city in the 1988 earthquake in Armenia.', 'title': 'Ian Gillan &amp; Tony Iommi: WhoCares'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Edwyn Stephen Collins (born 23 August 1959) is a Scottish musician, producer and record label owner from Edinburgh, Scotland. Collins was the lead singer for the 1980s post-punk band Orange Juice, which he co-founded. Following the group\'s split in 1985, Collins started a solo career. His 1994 single "A Girl Like You" was a worldwide hit.', 'title': 'Edwyn Collins'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Naked Thunder is a 1990 solo album by Ian Gillan, released soon after his departure from Deep Purple in 1989. It features a varied selection of songs, with one of Gillan\'s most passionate and impressive performances on power ballad "Loving on Borrowed Time" and traditional field lament "No More Cane on the Brazos". It was also the first album to feature Ian Gillan\'s long time writing partner Steve Morris. "Naked Thunder" was produced by Leif Mases and features a number of notable guest musicians, including drummer Simon Phillips and former Grease Band keyboard player Tommy Eyre.', 'title': 'Naked Thunder'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Javelins, sometimes also known as Ian Gillan & the Javelins, was a 1960s band fronted by Ian Gillan of Deep Purple. The band played live but never recorded in their initial spell together. The other members included rhythm guitarist Tony Tacon, bass player Tony Whitfield,drummer Keith Roach and lead guitarist Gordon Fairminer. All from Hayes/Heston area of West London.', 'title': 'The Javelins'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Dreamcatcher is a studio album by Ian Gillan, released in September 1997 in Japan, October 1997 in the United Kingdom and in May 1998 in the US. All songs were performed by Ian Gillan accompanied by Steve Morris. The album was being worked on between 1995 and 1997.', 'title': 'Dreamcatcher (Ian Gillan album)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Gillan's Inn is an album by Ian Gillan in celebration of his 40 years as a singer. The first release was a DualDisc composed of both a CD and a DVD side. The CD featured re-recorded tracks from all eras of Ian Gillan's singing career. In a recent interview Gillan observed that, despite the number of participants and guest appearances, this was the easiest project he ever put together.", 'title': "Gillan's Inn"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Joe Mennonna is an accomplished session musician who worked with Ian Gillan and Roger Glover on their 1988 album "Accidentally on Purpose", and toured with Ian Gillan in September 2006 in support of the "Gillan\'s Inn" album. He also appears on Gillan\'s "Live in Anaheim".', 'title': 'Joe Mennonna'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Raymond John Fenwick (born 18 July 1946) is an English guitarist and session musician, best known for replacing Steve Howe in The Syndicats, and as the lead guitarist of Ian Gillan's post Deep Purple solo project, the Ian Gillan Band.", 'title': 'Ray Fenwick'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Ian Gillan (born 19 August 1945) is an English singer and songwriter. He originally found commercial success as the lead singer and lyricist for Deep Purple.', 'title': 'Ian Gillan'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Toolbox is the second solo album by Ian Gillan originally released only in Europe, Japan and Brazil on German label EastWest. It was Gillan\'s last album before his second comeback with Deep Purple in August 1992. The subsequent mammoth 10-month tour, which crossed Europe and South America, proved Ian Gillan to be a strong live attraction. Although "Toolbox" wasn\'t a big commercial success it is considered by many as one of Gillan\'s finest records. The album was finally released domestically in the USA in 1997.', 'title': 'Toolbox (album)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Park’s Finest is a Filipino American inspired Southern BBQ restaurant in Echo Park, Los Angeles which started as a small catering company in 2009. The founders of the restaurant, Johneric Concordia, Christine Araquel-Concordia, Mike Pajimula, Ann Pajimula and Oscar Bautista, are Echo Park locals and long time friends who grew up in the neighborhood around Historic Filipinotown, Los Angeles. With assistance from an Asian Pacific Islander small business program and strong support from the surrounding community, The Park's Finest officially become a restaurant in 2012.", 'title': "The Park's Finest"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Whalebone Junction is an area within Nags Head, North Carolina where three major highways converge. The junction marks the eastern terminus of both U.S. 64 and U.S. Route 158, while NC 12 traverses the junction from north to south. The junction is a major landmark on the Outer Banks, as U.S. 64 and U.S. 158 provide the only highway links to the mainland, while NC 12 is the main road linking all of the Outer Banks. North of Whalebone Junction lies the main commercial district of Nags Head as well as the communities of Kill Devil Hills and Kitty Hawk. South of Whalebone Junction begins the Cape Hatteras National Seashore and the Pea Island National Wildlife Refuge. Whalebone Junction Information Station, immediately south of the junction itself, serves as the visitor center to the Cape Hatteras National Seashore and provides information on the National Park and local attractions.', 'title': 'Whalebone Junction, North Carolina'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Outer Banks (OBX) is a 200 mi string of barrier islands and spits off the coast of North Carolina and southeastern Virginia, on the east coast of the United States. They cover most of the North Carolina coastline, separating the Currituck Sound, Albemarle Sound, and Pamlico Sound from the Atlantic Ocean. The Outer Banks are a major tourist destination and are known around the world for their subtropical climate and wide expanse of open beachfront. The Cape Hatteras National Seashore has four campgrounds open to visitors. The treacherous seas off the Outer Banks and the large number of shipwrecks that have occurred there have given these seas the nickname Graveyard of the Atlantic. The Graveyard of the Atlantic Museum is located in Hatteras Village near a United States Coast Guard facility and the Hatteras ferry.', 'title': 'Outer Banks'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Outer Banks are the barrier islands along the east coast of North Carolina, that are extremely sensitive to environmental hazards, particularly hurricanes. This article is about how people of the Outer Banks prepare for natural disasters.', 'title': 'Hazard mitigation in the Outer Banks'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'North Carolina Highway 12 (NC\xa012) is a state highway that traverses the northeastern coastline of North Carolina, linking the peninsulas and islands of the northern Outer Banks. Most sections of NC\xa012 are two lanes wide, and there are also two ferry routes which maintain continuity of the route as it traverses the Outer Banks region. NC 12 is part of the Outer Banks Scenic Byway, a National Scenic Byway. The first NC 12 appeared on the 1924 North Carolina Official Map and at its height ran from NC 30 in Pollocksville to NC 48 near Murfreesboro. Over time it was replaced by both US 258 and NC 58 and ceased to exist in 1958. The current NC 12 first appeared on the 1964 state highway map running from US 158 in Nags Head to Ocracoke. In 1976 NC 12 was extended to US 70 on the mainland and in 1987 was extended north to Corolla.', 'title': 'North Carolina Highway 12'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Pine Island Airport (IATA: DUF) is a privately owned airport, located in the town of Corolla, North Carolina, owned by Turnpike Properties. The FAA ID is 7NC2 and IATA code DUF. The airport has one 3,450\xa0ft. runway, designated runway 17/35. As of March 10, 2017, the airport is operational with restrictions Contact Airport Manager, Outer Banks Airlines for use The airport is served by Outer Banks Airlines, some vetted charter operations and some vetted private aircraft.', 'title': 'Pine Island Airport'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Southern Living is a widely read lifestyle magazine aimed at readers in the Southern United States featuring recipes, house plans, garden plans,and information about Southern culture and travel. It is published by Birmingham, Alabama–based Southern Progress Corporation, a unit of Time Inc.', 'title': 'Southern Living'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Team Outer Banks is the first team registered from North Carolina to complete the Worrell 1000 sailboat race from Ft. Lauderdale, Florida to Virginia Beach, Virginia. Team Outer Banks competed and completed the event four years in a row from 1999 through 2002.', 'title': 'Team Outer Banks'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Andy Nelson\'s Barbecue is a BBQ restaurant in Cockeysville, Maryland. Founded by former Baltimore Colts safety and Super Bowl winner Andy Nelson, it is known for its hickory smoked BBQ. The restaurant regularly wins "Baltimore\'s Best BBQ" by "Baltimore Magazine" and the "City Paper".', 'title': "Andy Nelson's Southern Pit Barbecue"}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Pigman\'s Bar-B-Que is an Outer Banks landmark as well as a premiere BBQ restaurant on the Outer Banks of North Carolina. It started as a small ham shop on the Outer Banks in the late 1980s, and has since gone on to win multiple awards like "Best on the Beach." It has been featured in such publications as "Southern Living" magazine and "The Coast". According to the jingle it is on the "9 & 1/2 mile post."', 'title': 'Pigmans Bar-B-Que'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Boston Legal is an American legal comedy-drama created by David E. Kelley and produced in association with 20th Century Fox Television for ABC. The series aired from October 3, 2004, to December 8, 2008. The series, starring James Spader, with Candice Bergen, and William Shatner, is a spin-off of the long-running Kelley series "The Practice", following the exploits of former "Practice" character Alan Shore at the legal firm of Crane, Poole & Schmidt.', 'title': 'Boston Legal'}
