 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The first season of the American legal comedy-drama Suits originally aired on USA Network in the United States between June 23, 2011 and September 8, 2011. The season was produced by Hypnotic Films & Television and Universal Cable Productions, and the executive producers were Doug Liman, David Bartis and series creator Aaron Korsh. The series revolves around corporate lawyer Harvey Specter and his associate attorney Mike Ross who, between the two of them, have only one law degree. The season had six series regulars playing employees at the fictional Pearson Hardman law firm in Manhattan: Gabriel Macht, Patrick J. Adams, Rick Hoffman, Meghan Markle, Sarah Rafferty, and Gina Torres.', 'title': 'Suits (season 1)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The second season of the American legal comedy-drama Suits was ordered on August 11, 2011. The season originally aired on USA Network in the United States between June 14, 2012 and February 21, 2013. The season was produced by Hypnotic Films & Television and Universal Cable Productions, and the executive producers were Doug Liman, David Bartis and series creator Aaron Korsh. The season had six series regulars playing employees at the fictional Pearson Hardman law firm in Manhattan: Gabriel Macht, Patrick J. Adams, Rick Hoffman, Meghan Markle, Sarah Rafferty, and Gina Torres.', 'title': 'Suits (season 2)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The fifth season of the American legal comedy-drama Suits was ordered on August 11, 2014. The fifth season originally aired on USA Network in the United States between June 24, 2015 and March 2, 2016. The season was produced by Hypnotic Films & Television and Universal Cable Productions, and the executive producers were Doug Liman, David Bartis and series creator Aaron Korsh. The season had six series regulars playing employees at the fictional Pearson Specter Litt law firm in Manhattan: Gabriel Macht, Patrick J. Adams, Rick Hoffman, Meghan Markle, Sarah Rafferty, and Gina Torres.', 'title': 'Suits (season 5)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"Suits" is an American legal drama created by Aaron Korsh and premiered on USA Network in June 2011. The series revolves around Harvey Specter (Gabriel Macht), a senior partner at a top law firm in Manhattan, and his recently hired associate attorney Mike Ross (Patrick J. Adams) as they hide the fact that Mike does not have a law degree. Each episode focuses on a single legal case and its challenges while examining the work environment of the firm, Mike\'s and Harvey\'s personal relationships, and problems stemming from Mike\'s lack of a degree. The rest of the starring cast portray other employees at the firm: Louis Litt (Rick Hoffman), Rachel Zane (Meghan Markle), a paralegal who develops feelings for Mike; Donna Paulsen (Sarah Rafferty), Harvey\'s long-time legal secretary, close friend, and confidant; and Jessica Pearson (Gina Torres), the co-founder and managing partner of the firm.', 'title': 'List of Suits characters'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The fourth season of the American legal comedy-drama Suits was ordered on October 22, 2013. The fourth season originally aired on USA Network in the United States between June 11, 2014 and March 4, 2015. The season was produced by Hypnotic Films & Television and Universal Cable Productions, and the executive producers were Doug Liman, David Bartis and series creator Aaron Korsh. The season had six series regulars playing employees at the fictional Pearson Specter, later Pearson Specter Litt, law firm in Manhattan: Gabriel Macht, Patrick J. Adams, Rick Hoffman, Meghan Markle, Sarah Rafferty, and Gina Torres. Both Gabriel Macht and Patrick J. Adams made their director debut this season, with Macht directing the eleventh episode while Adams directed the 14th episode.', 'title': 'Suits (season 4)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The third season of the American legal comedy-drama Suits was ordered on October 12, 2012. The third season originally aired on USA Network in the United States between July 16, 2013 and April 10, 2014. The season was produced by Hypnotic Films & Television and Universal Cable Productions, and the executive producers were Doug Liman, David Bartis and series creator Aaron Korsh. The season had six series regulars playing employees at the fictional Pearson Darby, later Pearson Darby Specter and Pearson Specter, law firm in Manhattan: Gabriel Macht, Patrick J. Adams, Rick Hoffman, Meghan Markle, Sarah Rafferty, and Gina Torres.', 'title': 'Suits (season 3)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Pilot" is the pilot episode of the American legal comedy-drama "Suits", which premiered on USA Network in the United States on June 23, 2011. The episode was written by series creator Aaron Korsh and was directed by Kevin Bray. The series revolves around two lawyers who, between the two of them, have only one law degree.', 'title': 'Pilot (Suits)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Rachel Meghan Markle (born August 4, 1981), is an American actress, model and humanitarian from Los Angeles. Since 2011 she has portrayed Rachel Zane on the legal drama series "Suits" and is also known for her work as FBI special agent Amy Jessup in the sci-fi thriller "Fringe".', 'title': 'Meghan Markle'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Matthew William Goode (born 3 April 1978) is an English actor. He made his screen debut in 2002 with ABC\'s TV movie feature "Confessions of an Ugly Stepsister". His breakthrough role was in romantic comedy "Chasing Liberty" (2004), for which he received a nomination at Teen Choice Awards. He then appeared in supporting roles in Woody Allen\'s "Match Point" (2005), the German-British romantic comedy "Imagine Me and You" (2006), the period drama "Copying Beethoven" (2006). He gained praise for his performance as an aspiring artist in Julian Jarrold\'s drama "Brideshead Revisited" (2008) and as Ozymandias in the American neo-noir-superhero film "Watchmen" (2009), based on DC Comics\' limited series of the same name. He then starred in romantic comedy "Leap Year" (2010) and Australian drama "Burning Man" (2011), the latter earning him a nomination for Best Actor at the Film Critics Circle of Australia Awards.', 'title': 'Matthew Goode'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Ellie Parker is a 2005 American drama-comedy film, written and directed by Scott Coffey. The title character, played by Naomi Watts, is a young woman struggling as an actress in Los Angeles.', 'title': 'Ellie Parker'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Year Of Spectacular Men is an upcoming drama-comedy film which is directorial debut of actress Lea Thompson and stars her daughters, Madelyn Deutch (who also wrote the screenplay) and Zoey Deutch. The film had its world premiere in June 2017, under the "LA Muse" section in Los Angeles Film Festival 2017.', 'title': 'The Year Of Spectacular Men'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '[]Mohanlal] is an Indian actor, producer, and singer who has starred in both blockbuster and art house films for independent filmmakers. During his career, he has appeared in more than 340 feature films, primarily in Malayalam cinema but also in other languages including Hindi, Tamil, Telugu, and Kannada. In 1978, when he was 18, he started acting with a minor comedic role in the unreleased film "Thiranottam", before making screen debut in 1980 as antagonist in the romance film "Manjil Virinja Pookkal". His portrayal of Narendran, a sadistic husband, received recognition and the film developed a cult status in Malayalam cinema. Subsequently, Mohanlal was cast as the antagonist in many films. His first positive role was in "Padayottam" (1982), the first 70 mm film in Malayalam. In 1984 he starred in "Poochakkoru Mookkuthi", a comedy film whose success triggered a trend and popularised the genre in the 1980s. In an early critically acclaimed performance, Mohanlal played an antihero in the I. V. Sasi-directed thriller "Uyarangalil" (1984). In the same year, he co-founded Casino Films, a motion picture production company which later produced his popular comedies "Gandhinagar 2nd Street" (1986) and "Nadodikkattu" (1987).', 'title': 'Mohanlal filmography'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Rebecca Rigg (born 31 December 1967) is an Australian actress, best known for her roles in "Fatty Finn" and "Ellie Parker".', 'title': 'Rebecca Rigg'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Lola's Last Letter is a 2015 independent drama-comedy film written and directed by Valerie Brandy, starring Valerie Brandy, Annamarie Kenoyer, and Travis Quentin Young. The movie world-premiered at the TCL Chinese Theatre in Hollywood as a Competition Feature at the Dances with Films festival lineup. Brandy made the film—also her directorial debut—on a shoe-string budget with just seven people over seven days of principal photography, and shot entirely in Los Angeles and surrounding areas.", 'title': "Lola's Last Letter"}
