 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Naomi Ellen Watts (born 28 September 1968) is an English actress and film producer. She made her screen debut in the Australian drama film "For Love Alone" (1986) and then appeared in the Australian television series\' "Hey Dad. . ! " (1990), "Brides of Christ" (1991), "Home and Away" (1991) and the coming-of-age comedy-drama film "Flirting" (1991). After moving to America, Watts appeared in films, including "Tank Girl" (1995), "" (1996) and "Dangerous Beauty" (1998) and had the lead role in the television series "Sleepwalkers" (1997–1998).', 'title': 'Naomi Watts'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Claire Elizabeth Foy (born 16 April 1984) is an English actress. She studied drama and screen studies at Liverpool John Moores University and trained at the Oxford School of Drama, where she appeared in four plays, including "Watership Down". She made her screen debut in the pilot episode of "Being Human" (2008) and in an episode of the BBC soap opera "Doctors" (2008). Following her professional stage debut at the Royal National Theatre, she played the title role in the BBC One production of "Little Dorrit" (2008), and made her film debut as Anna in "Season of the Witch" (2011).', 'title': 'Claire Foy'}
