[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Parsifal (WWV 111) is an opera in three acts by German composer Richard Wagner. It is loosely based on "Parzival" by Wolfram von Eschenbach, a 13th-century epic poem of the Arthurian knight Parzival (Percival) and his quest for the Holy Grail (12th century).', 'title': 'Parsifal'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Parsifal is a 1904 American silent film produced by the Edison Manufacturing Company and directed by Edwin S. Porter. It is based on the 1882 opera "Parsifal" by Richard Wagner, and stars Adelaide Fitz-Allen as Kundry and Robert Whittier as Parsifal.', 'title': 'Parsifal (1904 film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Poul Elming (born 21 July 1949, Ålborg) is a Danish opera singer. He began his career as a baritone; making his professional debut in 1979 as a member of the Jutland Opera in Århus. He then pursued studies at the Juilliard School in New York City where his voice was re-trained in the tenor repertoire. In 1989, he made his debut as a tenor at the Royal Danish Theatre as the title hero in Richard Wagner\'s "Parsifal". He has since sung leading roles with major opera companies and festivals throughout the world, including the Bayreuth Festival, the Berlin State Opera, the Liceu, the Lyric Opera of Chicago, the Royal Opera, London, the San Francisco Opera, and the Vienna State Opera among others.', 'title': 'Poul Elming'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Helge Nissen (5 September 1871 in Rydhave ved Holstebro – 5 October 1926 in Copenhagen) was a Danish operatic bass-baritone, conductor, voice teacher, and film actor who was associated with the Royal Danish Theatre from 1897 until his death in 1926. He notably created roles in the world premieres of two operas by composer Carl Nielsen: Abner in "Saul og David" (1902) and Henrik in "Maskarade" (1906). His voice is preserved on a total of 70 recordings made with the Pathé, HMV and Deutsche Grammophon record companies from 1908–1914.', 'title': 'Helge Nissen'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'A Parsifal bell (German: "Parsifal Klavier Instrument") is a stringed musical instrument designed as a substitute for the church bells that are called for in the score of Richard Wagner\'s opera "Parsifal".', 'title': 'Parsifal bell'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Saul (HWV 53) is a dramatic oratorio in three acts written by George Frideric Handel with a libretto by Charles Jennens. Taken from the First Book of Samuel, the story of "Saul" focuses on the first king of Israel\'s relationship with his eventual successor, David; one which turns from admiration to envy and hatred, ultimately leading to the downfall of the eponymous monarch. The work, which Handel composed in 1738, includes the famous "Dead March", a funeral anthem for Saul and his son Jonathan, and some of the composer\'s most dramatic choral pieces. "Saul" was first performed at the King\'s Theatre in London on 16 January 1739.', 'title': 'Saul (Handel)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Plácido Domingo has made hundreds of opera performances, music albums, and concert recordings throughout his career as an operatic tenor. From his first operatic leading role as Alfredo in "La traviata" in 1961, his major debuts continued in swift succession: "Tosca" at the Hamburg State Opera and "Don Carlos" at the Vienna State Opera in 1967; "Adriana Lecouvreur" at the Metropolitan Opera, "Turandot" in Verona Arena and "La bohème" in San Francisco in 1969; "La Gioconda" in 1970; "Tosca" in Royal Opera House, Covent Garden in 1971; "La bohème" at the Bavarian State Opera in 1972; "Il trovatore" at the Paris Opéra in 1973 and "Don Carlo" at the Salzburg Festival in 1975, "Parsifal" in 1992 at the Bayreuth Festival; and the list continues until today; the same role is often recorded more than once.', 'title': 'Plácido Domingo discography'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Vilhelm Christoffer Herold (born March 19, 1865 in Hasle, Bornholm – died December 15, 1937 in Copenhagen) was an operatic tenor, voice teacher, and theatre director. Herold created the role of David in Carl Nielsen\'s opera "Saul og David" in 1902).', 'title': 'Vilhelm Herold'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Saul og David ("Saul and David") is the first of the two operas by the Danish composer Carl Nielsen. The four-act libretto, by Einar Christiansen, tells the Biblical story of Saul\'s jealousy of the young David, taken from the Book of Samuel. The first performance was at Det Kongelige Teater, Copenhagen on 28 November 1902.', 'title': 'Saul og David'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Gerd Grochowski (28 February 28, 1956, Krefeld – 16 January 2017, Mainz) was a German operatic bass-baritone who had an active international career from 1986 until his death in 2017. Particularly known for his performances in the operas of Richard Wagner, his roles included Donner in "Das Rheingold", Gunther in "Götterdämmerung", Klingsor in "Parsifal", Kurwenal in "Tristan und Isolde", Telramund in "Lohengrin", and Wotan in "The Ring Cycle". A graduate of the Hochschule für Musik und Tanz Köln, he was a longtime resident artist at the Cologne Opera. He appeared in leading roles as a guest artist at the Bayreuth Festival, the Berlin State Opera, the Bavarian State Opera, the Frankfurt Opera, the Hamburg State Opera, La Scala, the Liceu, the Linz State Theatre, the Stuttgart Opera, the Teatro Real, the Theater an der Wien, and the Salzburg Festival.', 'title': 'Gerd Grochowski'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Sunmin (Hangul: 선민, "Katakana": ソンミン, born August 4, 1987) is a South Korean singer who speaks and sings in Korean, Japanese, and English. She debuted in 2006, with the single "Keep Holding You," a collaboration with the Japanese R&B singer Toshinobu Kubota. Her career was initially focused on the Japanese market, but her work became focused in South Korea from 2009 to 2010. She also contributed to original soundtracks of South Korean television series "Master of Study" and "Gloria (2010 TV series)". In 2010 to 2011, she was in the main South Korean musical production of "Jekyll & Hyde" as Lucy. In 2012 to 2013, she reprised her role as Lucy in the South Korean national tour. In spring 2013, Sunmin played Josephine in the South Korean production of "Arsène Lupin", the musical.', 'title': 'Sunmin'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'A+ is the fourth extended play by South Korean singer Hyuna. The EP consists of five tracks and incoporates Pop and Hip-Hop music genres. It was released for digital download by Cube Entertainment and Universal Music on August 21, 2015. The physical album was released three days later on August 24. To promote the EP, Hyuna appeared on several South Korean music programs, including "Music Bank", "Show! Music Core" and "Inkigayo". "Roll Deep" was released at the title track for the EP.', 'title': 'A+ (EP)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Lee Jai-jin (Korean:이재진, born July 13, 1979) is a South Korean singer and dancer. Jai-jin is the sub rapper and main dancer of the South Korean boy group SechsKies, and served as the group's choreographer. SechsKies disbanded in 2000 but made a long-awaited reunion on 'ToToGa 2' special of 'Infinite Challenge' and signed with YG Entertainment in 2016.", 'title': 'Lee Jai-jin (musician, born 1979)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'A Talk is the third extended play by South Korean singer Hyuna. The EP consists of five tracks and incorporates Trap, Hip-Hop and R&B music genres. It was released for digital download by Cube Entertainment and Universal Music on July 28, 2014. The physical album was released a day later on July 29. To promote the EP, Hyuna appeared on several South Korean music programs, including "Music Bank", "Show! Music Core" and "Inkigayo". "Red" was released as the title track for the EP.', 'title': 'A Talk'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Talk About S (stylized as Talk about S.) is the second solo extended play (EP) by South Korean singer and actress Gain. It was released on October 5, 2012, and distributed by LOEN Entertainment. The album is a contrast to her solo debut EP due to its delightful and brighter sound, "more varied palette" yet still intacts "the pervasive seductiveness" which was first introduced in "Step 2/4" (2010). As executive producer, Jo Yeong-Cheol and enlisted collaborators such as KZ and Yoon Jong-shin to create the EP, featuring a total of five tracks.', 'title': 'Talk About S'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"Bubble Pop!" is a song recorded by South Korean singer Hyuna for her first extended play "Bubble Pop! " (2011). It was released as the title track from the EP by Cube Entertainment and Universal Music on July 5, 2011. The lyrics were written by Shinsadong Tiger and Choi Kyusung, who also composed the music. In order to promote the song and EP, Hyuna appeared on several South Korean music programs, including "Music Bank", "Show! Music Core" and "Inkigayo". A music video for the song was released on July 4 and has surpassed the 100 million views on YouTube, making her the first female Korean solo artist to do it.', 'title': 'Bubble Pop! (song)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Lee Ki-seop (Korean: 이기섭 ; born January 17, 1991), commonly known as Kiseop, is a South Korean singer, dancer, actor and model. He is best known for being a member of South Korean boy group U-KISS formed by NH Media in 2008. He joined U-KISS in November 2009.', 'title': 'Lee Ki-seop'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Kim Hyun-ah (born June 6, 1992), better known by the mononym Hyuna, stylized as HyunA, is a South Korean singer, dancer, songwriter and model. She rose to fame in the late 2000s as a member of the girl group Wonder Girls, leaving the ensemble shortly after their debut in 2007 and subsequently joining the girl group 4Minute in 2009. Hyuna began a solo career in 2010, which she describes as "performance-oriented music". Her debut single "Change" peaked at #2 on the Gaon Digital Chart.', 'title': 'Hyuna'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Dong Young-bae (; born 18 May 1988), better known by his stage name Taeyang (meaning "sun" in Korean) and SOL (when performing in Japan), is a South Korean singer, songwriter and dancer. After appearing in Jinusean\'s music video "A-yo," Taeyang began training under YG Entertainment at the age of 12. Six years later, he made his debut in 2006 as a member of the South Korean boy band Big Bang. While the quintet\'s debut was met with lukewarm receptions, their follow-ups cemented their popularity, becoming one of the best-selling digital group of all-time in Asia and one of the best-selling boy bands in the world.', 'title': 'Taeyang'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"I" is a Korean song recorded by South Korean singer Kim Tae-yeon (better known by her mononym Taeyeon) featuring Verbal Jint, taken from Taeyeon\'s debut EP of the same name. It was written by herself, Mafly, and Verbal Jint, and produced by Myah Marie Langston, Bennett Armstrong, Justin T. Armstrong, Cosmopolitan Douglas, David Quinones, Jon Asher, and Ryan S. Jhun. It was released digitally on October 7, 2015 in conjunction with the release of the EP, and was released on Korean Broadcasting System\'s "K-Pop Connection" radio on October 9.', 'title': 'I (Taeyeon song)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Lulu (or Lula) Belle Madison White (1900-1957) was a teacher and civil rights activist in Texas during the 1940s and 1950s. In 1939, White was named as the president of the Houston chapter of the National Association for the Advancement of Colored People (NAACP) before becoming executive secretary of the branch in 1943. Under her leadership, the Houston chapter of the NAACP more than doubled in size from 1943 to 1948.', 'title': 'Lulu Belle Madison White'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Hubert Thomas Delany ( ; May 11, 1901 - December 28, 1990) was an American civil rights pioneer, a lawyer, politician, Assistant U.S. Attorney, the first African American Tax Commissioner of New York and one of the first appointed African American judges in New York City. Judge Delany was on the board of Directors for the National Association for the Advancement of Colored People (NAACP), the Harlem YMCA and became an active leader in the Harlem Renaissance. He also served as a Vice President of the NAACP Legal Defense and Educational Fund.', 'title': 'Hubert Thomas Delany'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Clement Garnett Morgan (1859-1929) was an American attorney, civil rights activist, and city official of Cambridge, Massachusetts. Born into slavery in Virginia and freed by the Emancipation Proclamation, he trained as a barber before moving to Massachusetts to pursue his education. He was the first African American to earn degrees from both Harvard University and its law school; the first African American to deliver Harvard's senior class oration; and the first black alderman in New England. As an attorney he handled many civil rights cases, in one instance closing down a segregated school. He was a founding member of the Niagara Movement and of the Boston branch of the National Association for the Advancement of Colored People.", 'title': 'Clement G. Morgan'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Daisy Elizabeth Adams Lampkin (August 9, 1883 – March 10, 1965) was an American [[suffragist[[Civil rights movement|civil rights]] activist, organization executive, and community practitioner whose career spanned over half a century. Lampkin’s effective skills as an orator, fundraiser, organizer, and political activist guided the work being conducted by the [[National Association of Colored Women]] (NACW); [[National Association for the Advancement of Colored People]] (NAACP); [[National Council of Negro Women]] and other leading civil rights organizations of the [[Progressive Era]].', 'title': 'Daisy Elizabeth Adams Lampkin'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'James Weldon Johnson (June 17, 1871June 26, 1938) was an American author, educator, lawyer, diplomat, songwriter, and civil rights activist. Johnson is best remembered for his leadership of the National Association for the Advancement of Colored People (NAACP), where he started working in 1917. In 1920 he was the first African American to be chosen as executive secretary of the organization, effectively the operating officer. He served in that position from 1920 to 1930. Johnson established his reputation as a writer, and was known during the Harlem Renaissance for his poems, novels, and anthologies collecting both poems and spirituals of black culture.', 'title': 'James Weldon Johnson'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'William Edward Burghardt "W. E. B." Du\xa0Bois ( ; February 23, 1868 – August 27, 1963) was an American sociologist, historian, civil rights activist, Pan-Africanist, author, writer and editor. Born in Great Barrington, Massachusetts, Du\xa0Bois grew up in a relatively tolerant and integrated community. After completing graduate work at the University of Berlin and Harvard, where he was the first African American to earn a doctorate, he became a professor of history, sociology and economics at Atlanta University. Du\xa0Bois was one of the co-founders of the National Association for the Advancement of Colored People (NAACP) in 1909.', 'title': 'W. E. B. Du Bois'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "James Charles Evers (born September 11, 1922) is an American civil rights activist and former politician. A Republican, Evers was known for his role in the Civil Rights Movement along with his younger brother Medgar Evers. He was made the National Association for the Advancement of Colored People (NAACP) State Voter Registration Chairman in 1954. After his brother's assassination in 1963, Evers took over his position as field director of the NAACP in Mississippi. As field director, Evers organized and led many demonstrations for the rights of African Americans.", 'title': 'Charles Evers'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Grace Nail Johnson (February 27, 1885 – November 1, 1976) was a civil rights activist and patron of the arts, and wife of writer James Weldon Johnson.', 'title': 'Grace Nail Johnson'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Terry A. Francois ( 1922 – June 9, 1989) was an African American attorney, civil rights activist, and politician. He served as San Francisco chapter president of the National Association for the Advancement of Colored People and became the first African American to serve on the San Francisco Board of Supervisors.', 'title': 'Terry Francois'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Ernest Samuel McBride, Sr (November 20, 1909 – May 5, 2007) was an African American civil rights activist and community leader based in Long Beach, California. He fought to improve the working prospects and conditions of African Americans in the shipyards, grocery stores, housing, police and fire departments in Long Beach. He was a co-founder of the Long Beach chapter of National Association for the Advancement of Colored People (NAACP). Like Martin Luther King, Jr., McBride employed Mahatma Gandhi's model of peaceful protest to achieve civil rights gains. He became a target of the FBI's CONINTELPRO, which targeted many of the country's civil rights organizations and leaders, including Martin Luther King, Jr. - most famously resulting in the FBI - King Suicide Letter. McBride's legacy is memorialized in numerous awards, historic land marking of his home, and the naming of a high school and park.", 'title': 'Ernest McBride, Sr.'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Daqing (; formerly romanized as Taching) is a prefecture-level city in the west of Heilongjiang province, People\'s Republic of China. The name literally means "Great Celebration". Daqing is known as the Oil Capital of China and has experienced a phenomenal boom since oil was discovered at the Daqing Oil Field in 1959.', 'title': 'Daqing'}
