 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Lucky Street (Chinese: 好运街 "Haoyunjie") is a restaurant street in Beijing uniquely offering a street of almost entirely foreign cuisine, many restaurants of which are joint ventures or foreign run. The street includes German, Spanish, Italian, French, Indian, Japanese, Korean and a smaller number of Chinese restaurants. The street was deliberately developed by the Chaoyang District municipal government to create an area of restaurants catering to the Chaoyang District\'s large expat community. The street runs along one side of the road opposite another development on land formerly part of Chaoyang Park, the Solana Shopping Village.', 'title': 'Lucky Street, Beijing'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Haojiang District () is a district of Shantou, Guangdong province, People's Republic of China. It was established in March 2003, consisting the former Dahao (达濠) and Hepu (河浦) districts. It covers 134.88 km2 . Dahao Island, which covers about 80 km2 , is part of Shantou special economic zone, to the west of Chaoyang District. Overlooking across the Queshi sea (礐石海), there are Longhu District (龙湖) and Jinping District (金平). Located on the coast of the South China Sea, Haojiang District has about 20 harbours. It has a population of 270,000.", 'title': 'Haojiang District'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Shuangjing Subdistrict () is a subdistrict of Chaoyang District, Beijing, located in the vicinity of Beijing East Railway Station and the Beijing CBD Its boundaries are the Tonghui River to the North, the East 4th Ring Road to the East, Jinsong High Street to the South, and the boundary between Chaoyang District and Dongcheng District to the West. , it had 12 residential communities (社区 ) under its administration.', 'title': 'Shuangjing Subdistrict, Beijing'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Haimen () is a town of Chaoyang District, Shantou, in the east of Guangdong province, China, and is situated on the South China Sea coast. It administers 16 villages, and in 2005, it had a population of about 114,300 residing in a total area of 38.5 km2 , although 10.7 km2 of it is ocean. In December 2011, it was the site of protests where thousands of demonstrators spoke out over plans to expand a coal-fired power plant in the town.', 'title': 'Haimen, Guangdong'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Beijing Origus Food & Beverage Ltd., doing business as Origus Pizza Buffet () or Origus (), is a Chinese Western-style buffet chain. It is headquartered in Chaoyang District, Beijing. Previously it was headquartered in Wangjiao Plaza in Wangjing Subdistrict of Chaoyang District.', 'title': 'Origus'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Cheng Lianyuan (; born December 1961) is a Chinese politician, and current Communist Party Secretary of Kunming, the capital of Yunnan province. Born in Beijing, Cheng graduated with a degree in engineering at the Beijing University of Technology. He began work as a mechanical factory worker, he then worked in a series of management roles at different companies in the capital. He entered the municipal government to head up the department of Industrial Advancement. Then he became district governor of Chaoyang District, Beijing, then in July 2012 he was named Chaoyang District party chief. In July 2015 he was named party chief of Kunming.', 'title': 'Cheng Lianyuan'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Chaoyang District (postal: Chaoyang; ) is a district in the municipality of Shantou, Guangdong Province, China.', 'title': 'Chaoyang District, Shantou'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'All Hail the King is a 2014 American direct-to-video short film featuring the Marvel Cinematic Universe (MCU) character Trevor Slattery, produced by Marvel Studios and distributed by Walt Disney Studios Home Entertainment on the home media release of "". It is a follow up and spin-off of "Iron Man 3", and is the fifth film in the Marvel One-Shots short film series. The film is written and directed by Drew Pearce, and is set in the Marvel Cinematic Universe, sharing continuity with the films of the franchise. It stars Ben Kingsley, Scoot McNairy, Lester Speight, and Sam Rockwell, with Kingsley reprising his role from "Iron Man 3", and Rockwell reprising his role from "Iron Man 2". In "All Hail the King", a documentary filmmaker interviews the infamous fake terrorist Trevor Slattery from behind bars.', 'title': 'All Hail the King'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Item 47 is a 2012 American direct-to-video short film featuring the Marvel Comics organization S.H.I.E.L.D. (Strategic Homeland Intervention Enforcement and Logistics Division), produced by Marvel Studios and distributed by Walt Disney Studios Home Entertainment on the home media release of "Marvel\'s The Avengers". It is a follow up and spin-off of "The Avengers", and is the third film in the Marvel One-Shots short film series. The film is directed by Louis D\'Esposito, with a screenplay by Eric Pearson, and is set in the Marvel Cinematic Universe (MCU), sharing continuity with the films of the franchise. It stars Lizzy Caplan, Jesse Bradford, Maximiliano Hernández, and Titus Welliver, with Hernández reprising his role from the film series. In "Item 47", two civilians come across a Chitauri gun and use it to commit crimes.', 'title': 'Item 47'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Televisa San Ángel (originally Estudios y Laboratorios San Ángel, S.A.) is a film and television studio located in Mexico City. It was originally built by Jorge Stahl as a motion picture studio, and in the 1970s would be sold to the Azcárraga family, which, through ownership of the Televisa networks, continues to own the studios. It is the headquarters facility of the Centro de Educación Artística (CEA) and the Videocine (formerly Televicine) motion picture production and distribution company. The network's Centro de Post Produccion is also housed at San Ángel. Moreover, it is best known as a motion picture and television studio. It is the oldest movie and television production facility in Mexico and the most famous telenovela studio facility in Latin America. It was one of the four main Mexican film studios along with Estudios Churubusco, Estudios América, and Estudios Tepeyac.", 'title': 'Televisa San Ángel'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Marvel One-Shots are a series of direct-to-video short films produced by Marvel Studios, set within the Marvel Cinematic Universe (MCU), released from 2011 to 2014. They are included as special features in the MCU films' Blu-ray and digital distribution releases, but are not included in the DVD releases. Each of the films, which range from 4 to 15 minutes, are designed to be a self-contained story that provides more backstory for characters or events introduced in the films. Two of the shorts have been the inspiration for television series set in the MCU.", 'title': 'Marvel One-Shots'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Charles Evans Jr. is an American film producer and documentary film director. He produced Johnny Depp\'s first directorial effort, "The Brave". He was one of four producers on the 2004 Howard Hughes biopic "The Aviator", although his production credit was controversial. Evans is the nephew of former motion picture studio executive Robert Evans, and the son of fashion industry executive and motion picture producer Charles Evans.', 'title': 'Charles Evans Jr.'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Phillip "Phil" Coulson is a character portrayed by Clark Gregg in the films and television series of the Marvel Cinematic Universe (MCU). A high-ranking member of the espionage agency S.H.I.E.L.D., he first appeared in the 2008 film "Iron Man", the first film in the MCU. Gregg went on to appear in "Iron Man 2" (2010), "Thor" (2011), and "The Avengers" (2012). He additionally headlines the television series "Agents of S.H.I.E.L.D." (2013–), appears in two Marvel One-Shots (2011), has been featured in various tie-in comics, and appears in the digital series "" (2016), all set in the MCU. The character also appears in other media, including comics published by Marvel Comics.', 'title': 'Phil Coulson'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Marvel Studios, LLC (originally known as Marvel Films from 1993 to 1996) is an American motion picture studio based at The Walt Disney Studios in Burbank, California and is a subsidiary of Walt Disney Studios, itself a wholly owned division of The Walt Disney Company, with film producer Kevin Feige serving as president. Previously, the studio was a subsidiary of Marvel Entertainment until The Walt Disney Company reorganized the companies in August 2015.', 'title': 'Marvel Studios'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The institution that is now the LDS Motion Picture Studios began as the BYU Motion Picture Studio in 1953, and led by Wetzel Whitaker. It was originally located in a building called the Green Barn where the Ernest L. Wilkinson Center on Brigham Young University (BYU) Campus is now located.', 'title': 'LDS Motion Picture Studios'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Nestor Film Company, originally known as the Nestor Motion Picture Company, is a defunct American motion picture production company. It was founded in 1909 as the West Coast production unit of the Centaur Film Company located in Bayonne, New Jersey. On October 27, 1911, Nestor established the first permanent motion picture studio in Hollywood, California, and produced the first Hollywood films. The company merged with its distributor, the Universal Film Manufacturing Company, on May 20, 1912. Nestor became a brand name Universal used until at least mid-1917.', 'title': 'Nestor Film Company'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Solax Studios was an American motion picture studio founded in 1910 by executives from the Gaumont Film Company of France. Alice Guy-Blaché, her husband Herbert, and a third partner, George A. Magie, established The Solax Company. Alice Guy-Blaché was artistic director and the director for many of its films, while her husband Herbert Blaché managed production for the new company. They took over the studio Gaumont had built in Flushing, New York in 1908 for the production of Chronophone sound films, a venture which proved unsuccessful for Gaumont. Solax produced silent films in Flushing from October 1910 to the summer of 1912. Prospering, Solax invested more than $100,000 in a modern production plant in 1912 in Fort Lee, New Jersey, which had become the center of America's first motion picture industry.", 'title': 'Solax Studios'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "American Wrestler: The Wizard is a 2016 sports biographical film set in the world of competitive high school wrestling, and starring William Fichtner, Jon Voight, Ali Afshar, Gabriel Basso, Kevin G. Schmidt, Lia Marie Johnson and George Kosturos. In 1980, 17-year-old Ali Jahani escapes Iran after the Iran hostage crisis and must adjust to life in a small California town only to face more hostility in America due to the hostage crisis. Wanting to fit in, Ali joins the school's wrestling team and becomes the squad's star member. Ali faces a mountain of adversity everywhere he turns, but through determination and with a chance to change how others see him, Ali must step up and learn to be a hero against all odds.", 'title': 'American Wrestler: The Wizard'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Angelina Jolie Pitt ( ; née Voight; born June 4, 1975) is an American actress, filmmaker, and humanitarian. She has received an Academy Award, two Screen Actors Guild Awards, and three Golden Globe Awards, and has been cited as Hollywood\'s highest-paid actress. Jolie made her screen debut as a child alongside her father, Jon Voight, in "Lookin\' to Get Out" (1982). Her film career began in earnest a decade later with the low-budget production "Cyborg 2" (1993), followed by her first leading role in a major film, "Hackers" (1995). She starred in the critically acclaimed biographical cable films "George Wallace" (1997) and "Gia" (1998), and won an Academy Award for Best Supporting Actress for her performance in the drama "Girl, Interrupted" (1999).', 'title': 'Angelina Jolie'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Fearless Frank is a 1967 film directed by Philip Kaufman. It is notable as the film debut of Jon Voight. Voight plays a murdered drifter who gets reanimated and turned into a superhero by a scientist (Severn Darden). Other notable cast members include "The Man With the Golden Arm" author Nelson Algren as a mobster named Needles, and "Word Jazz" vocal artist Ken Nordine as the narrator, credited as "The Stranger."', 'title': 'Fearless Frank'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'James Haven (born James Haven Voight; May 11, 1973) is an American actor and producer. He is the son of actors Jon Voight and Marcheline Bertrand, and the older brother of actress Angelina Jolie.', 'title': 'James Haven'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'American actor Dustin Hoffman began his career by appearing in an episode of "Naked City" in 1961. His first theatrical performance was 1961\'s "A Cook for Mr. General" as Ridzinski. Following several guest appearances on television, he starred in the 1966 play "Eh? "; his performance garnered him both a Theatre World Award and Drama Desk Award. Hoffman made his film debut in 1967 when he appeared in the comedy "The Tiger Makes Out". In the same year, his breakthrough role as Benjamin "Ben" Braddock, the title character in Mike Nichols\' comedy-drama "The Graduate", led to Hoffman achieving star status and his first Academy Award nomination. He then acted in the play "Jimmy Shine" as the eponymous character and the comedy film "Madigan\'s Millions" (both 1968). In 1969, he starred alongside Jon Voight in the Academy Award for Best Picture winner "Midnight Cowboy", which Hoffman was nominated for the Academy Award for Best Actor a second time.', 'title': 'Dustin Hoffman filmography'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Coming Home is a 1978 American drama film directed by Hal Ashby, and starring Jane Fonda, Jon Voight and Bruce Dern. The screenplay by Waldo Salt and Robert C. Jones was from a story by Nancy Dowd. The film follows between a young woman, her Marine husband, and the paralyzed Vietnam War veteran she meets while her husband is overseas. Fonda and Voight won Academy Awards for their performances, while Dern was nominated for an Academy Award.', 'title': 'Coming Home (1978 film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Lookin’ to Get Out is a 1982 comedy film directed by Hal Ashby and written by Al Schwartz and Jon Voight, who also stars. Voight's daughter, Angelina Jolie, then seven years old, makes her acting debut by briefly appearing as Voight's character's daughter near the end of the movie. The film also stars Ann-Margret and Burt Young.", 'title': "Lookin' to Get Out"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Barry Voight (born 1937) is an American geologist, volcanologist, author, and engineer. He is also the brother of actor Jon Voight and songwriter Chip Taylor, and the uncle of actress Angelina Jolie. After completing a five-year intensive dual-degree program at the University of Notre Dame, Voight became a teaching assistant there while pursuing his master's degree. He then studied at Cornell University for a year before transferring to Columbia University, where he earned his Ph.D. in geology in 1965. Voight worked as a professor of geology at several universities, including Pennsylvania State University, where he taught from 1964 until his retirement in 2005; he remains an emeritus professor there. He still conducts research, focusing on rock mechanics, plate tectonics, disaster prevention, and geotechnical engineering.", 'title': 'Barry Voight'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Angelina Jolie is an American actress and filmmaker. As a child, she made her screen debut in the 1982 comedy film "Lookin\' to Get Out", acting alongside her father Jon Voight. Eleven years later she appeared in her next feature, the low-budget film "Cyborg 2", a commercial failure. She then starred as a teenage hacker in the 1995 science fiction thriller "Hackers", which went on to be a cult film despite performing poorly at the box-office. Jolie\'s career prospects improved with a supporting role in the made-for-television film "George Wallace" (1997), for which she received the Golden Globe Award for Best Supporting Actress – Television Film. She made her breakthrough the following year in HBO\'s television film "Gia" (1998). For her performance in the title role of fashion model Gia Carangi, she won the Golden Globe Award for Best Actress – Television Film.', 'title': 'Angelina Jolie filmography'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Lia Marie Johnson (born November 23, 1996) is an American singer, songwriter, actress and Internet personality notable for appearing in various web series, including the Emmy-winning web series "Kids React" created by the Fine Brothers, and for her own vlogging and social media output. She is known for her starring role in the Nickelodeon movie "Terry the Tomboy" and for recurring roles in AwesomenessTV\'s Side Effects TV Series and My Music. In 2012 her personal YouTube channel, "Lia Marie Johnson", was reported to have received 16 million views. As of 2017, Lia\'s YouTube channel is reported to have surpassed 117 million views and currently maintains over 1.7 million subscribers, while her Instagram account was followed by 2.3 million followers. In a 2014 "Adweek" profile she was referred to as one of "10 of the biggest young stars on YouTube". In 2015 she was named one of the Top 100 YouTubers in the world.', 'title': 'Lia Marie Johnson'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'This list of France national football team records contains statistical accomplishments related to the France national football team (French: "Equipe de France" ), its players, and its managers. The France national team represents the nation of France in international football. It is fielded by the French Football Federation (French: "Fédération Française de Football" ) and competes as a member of UEFA.', 'title': 'France national football team records'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Didier Claude Deschamps (] ; born 15 October 1968) is a retired French footballer and current manager of the France national team. He played as a defensive midfielder for several clubs, in France, Italy, England and Spain, such as Marseille, Juventus, Chelsea and Valencia, as well as Nantes and Bordeaux. Nicknamed "the water-carrier" by former France team-mate Eric Cantona, Deschamps was an intelligent and hard-working defensive midfielder who excelled at winning back possession and subsequently starting attacking plays, and also stood out for his leadership throughout his career. As a French international, he was capped on 103 occasions and took part at three UEFA European Football Championships and one FIFA World Cup, captaining his nation to victories in the 1998 World Cup and Euro 2000.', 'title': 'Didier Deschamps'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The France national football team (French: "Equipe de France" ) represents the nation of France in international association football. It is fielded by the French Football Federation (French: "Fédération Française de Football" ), the governing body of football in France, and competes as a member of the Union of European Football Associations (UEFA), which encompasses the countries of Europe. The team played its first official international match on 1 May 1904 against Belgium. Since its first competitive match, more than 800 players have made at least one international appearance for the team, only players with 20 or more offici Jean Ducret became the first French international to reach 20 caps, doing so on 29 March in a 2–0 defeat to Italy. He was also one of the first permanent captains of the national team. Ducret was later surpassed by defender Raymond Dubly and goalkeeper Pierre Chayriguès, who both played with the national team until 1925. Dubly finished his international career with 31 caps. Three years after retiring from the national team, Dubly\'s amount was exceeded by Jules Dewaquez, who went on to finish his career with 41 appearances. Dewaquez\'s record stood for nearly a decade before his amount was equaled by Edmond Delfour in 1938 and later surmounted by Étienne Mattler a year later. Similar to Dubly, Mattler\'s amount was exceeded, however after two decades, by former Stade de Reims defenders Roger Marche and Robert Jonquet. It was the former player who took over the record outperforming Jonquet by just five caps. Marche\'s 63 appearances remained the France national team record for appearance-making for 24 years, the longest time between the record being broken and set again. Marche was surpassed by Marius Trésor, who set the record after appearing in an October 1983 friendly match against Spain.', 'title': 'List of France international footballers'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Aviron Bayonnais Football Club (] ; commonly referred to as simply Bayonne) is a French association football club based in Bayonne. The club is a part of a sports club that was formed in 1904 that is also known for its rugby union club. The football club was founded in 1935 and currently play in the Championnat National 3, the fifth level of French football. Bayonne plays its home matches at the Stade Didier Deschamps located in the city. It is named after Bayonne native, former youth player and the 1998 FIFA World Cup and UEFA Euro 2000 winning captain Didier Deschamps, who also played for Marseille and Juventus.', 'title': 'Aviron Bayonnais FC'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The France national football team manager was first established on 25 April 1964 following the appointment of the country\'s first national team manager Henri Guérin. Before this, the France national team was selected by a selection committee, a process in which the French Football Federation would select coaches and trainers from within the country or abroad to prepare the side for single games and tournaments, but with all decisions ultimately remaining under the control of the committee. From 1904–1913, the USFSA headed the committee, which was referred to as the "Commission Centrale d\'Association". The committee was controlled by André Espir and André Billy and featured little to no physical preparation for upcoming matches. In 1913, the "Comité Français Interfédéral", a precursor to the French Football Federation, took over the committee following the USFSA becoming affiliated with the organization and secretary general Henri Delaunay took control.', 'title': 'France national football team manager'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The French football champions are the winners of the highest league of football in France, Ligue 1. Since the National Council of the French Football Federation voted in support of professionalism in French football in 1930, the professional football championship of France has been contested through Ligue 1, formerly known as Division 1 from 1933–2002. Prior to this, the first division championship of French football was contested through a league ran by the Union des Sociétés Françaises de Sports Athlétiques (USFSA), an organization that supported amateur sport. The USFSA's league ran from 1894–1919 and awarded 22 league titles before being suspended in 1915 due to World War I and the creation and success of the Coupe de France, which had quickly become the country's national competition. The USFSA returned in 1919 changing the league into numerous regional amateur leagues that awarded no league title. This system lasted from 1919–1926. In 1926, the first division's reigns were handed over to the French Football Federation. The federation organized and ran a league composed of the regional amateur league champions called the Championnat de France amateur from 1927–1929 and awarded three titles before the league was converted to the professional league that exists today in 1932.", 'title': 'List of French football champions'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Gérard Houllier, OBE (] ; born 3 September 1947) is a French football manager and former player. His past clubs include Paris Saint-Germain, Lens and Liverpool, with whom he won the FA Cup, League Cup and UEFA Cup in 2001. He then guided Olympique Lyonnais to two French titles, before announcing his resignation on 25 May 2007. He became manager of Aston Villa in September 2010. He also coached the France national team between 1992 and 1993. He assisted Aimé Jacquet in the FIFA World Cup 1998, was part of UEFA's and FIFA's Technical Committee in the 2002 and 2006 World Cup finals, and technical director for the French Football Federation during the 2010 finals. In June 2011, he stepped down from club coaching, leaving his managerial role at Aston Villa, following frequent hospitalisation over heart problems.", 'title': 'Gérard Houllier'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The France national football team (French: "Equipe de France" ) represents the nation of France in international association football. It is fielded by the French Football Federation (FFF) (French: "Fédération Française de Football" ) and competes as a member of the Union of European Football Associations (UEFA). The team played its first official international match on 1 May 1904 against Belgium. Since its first competitive match, more than 800 players have made at least one international appearance for the team. Of them, 105 have served as captain of the national team. This list contains football players who have served as captain of the French national team and is listed according to their number of matches captained.', 'title': 'List of France national football team captains'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The France national under-21 football team (French: "Equipe de France Espoirs" ), known in France as Les Espoirs (] , "The Hopes"), is the national under-21 football team of France and is controlled by the French Football Federation. The team competes in the UEFA European Under-21 Football Championship, held every two years. The team was previously coached by former Toulouse manager Erick Mombaerts, however, following the team\'s failure to qualify for the 2013 UEFA European Under-21 Football Championship in October 2012, he agreed to leave the position.', 'title': 'France national under-21 football team'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The France national under-19 football team is the national under-19 football team of France and is controlled by the French Football Federation. The team competes in the annual UEFA European Under-19 Football Championship. They were the 2010 champions of the competition having won on home soil. The under-19 team also contests the qualification matches needed to play in the FIFA U-20 World Cup, though the competition is classified as an under-20 tournament.', 'title': 'France national under-19 football team'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Nagaoka University of Technology (長岡技術科学大学 , Nagaoka Gijutsu Kagaku Daigaku ) , abbreviated as Nagaoka Gidai, is a national technology university founded in 1976 in Nagaoka, Niigata, Japan. It is one of only two Universities of Technology, a form of university in Japan, the other being Toyohashi University of Technology in Aichi. Many students from colleges of technology, a 5-year college called "kosen" in Japan have enrolled. The university requires 4th year students to spend up to five months on-the-job experience (internship) in private enterprises, government agencies, and elsewhere. Having a high employment rate in the national universities in Japan.', 'title': 'Nagaoka University of Technology'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Adam Smith University (also known as Adam Smith University of Liberia and École Supérieure Universitaire Adam Smith) is an unaccredited private distance learning university founded in 1991 by Dr. Donald Grunewald (MA Harvard 1955, MBA Harvard 1959, DBA Harvard 1962), who is still its president. Grunewald was president of Mercy College between 1972 and 1984. Since 1984 Grunewald is professor of Management at the Hagan School of Business at Iona College, teaching courses in Business Policy and Strategic Management (source: Iona college). Grunewald served as a Member of Advisory Board of The Wilton Bank (source: Bloomberg). Adam Smith university espouses the principle of independence from state control, believing that such control prevents it from furthering its mission.', 'title': 'Adam Smith University'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The National University of Trujillo (Spanish: "Universidad Nacional de Trujillo" ) (UNT) is a major public university located in Trujillo, Peru, capital of the department of La Libertad. The university was founded by Simón Bolívar and José Faustino Sánchez Carrión, who met in Huamachuco; they signed the decree of foundation on May 10, 1824, before Peru\'s independence from Spain. National University of Trujillo, was the first republican university founded in Peru.', 'title': 'National University of Trujillo'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Hélio Alonso University or FACHA is a private university founded on December 6, 1971, in Rio de Janeiro, Brazil by professor Hélio Alonso (1929-2015). It has two campi: one located in Méier and one in Botafogo.', 'title': 'Faculdades Integradas Hélio Alonso'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': "Kristine Moore Gebbie is professor at the Flinders University School of Nursing & Midwifery in Adelaide, Australia. From 2008-2010, she was the Joan Hansen Grabe Dean of the Hunter-Bellevue School of Nursing, Hunter College-City University of New York. Before moving to Hunter College, Gebbie was the Elizabeth Standish Gill Professor at the Columbia University School of Nursing and Director of Columbia's Center for Health Policy.", 'title': 'Kristine Gebbie'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The National University of Córdoba (Spanish: "Universidad Nacional de Córdoba" , UNC), founded in 1613, is the oldest university in Argentina, the fourth oldest in South America and the sixth oldest in Latin America. It is located in Córdoba, the capital of Córdoba Province. Since the early 20th century it has been the second largest university in the country (after the University of Buenos Aires) in terms of the number of students, faculty, and academic programs. As the location of the first university founded in the land that is now Argentina, Córdoba has earned the nickname La Docta (roughly translated, "The Wise").', 'title': 'National University of Córdoba'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Flinders University is a public university in Adelaide, South Australia. Founded in 1966, it was named in honour of navigator Matthew Flinders, who explored and surveyed the South Australian coastline in the early 19th century.', 'title': 'Flinders University'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The University of Aberdeen is a public research university in Aberdeen, Scotland. It is an ancient university founded in 1495 when William Elphinstone, Bishop of Aberdeen, petitioned Pope Alexander VI on behalf of James IV, King of Scots to establish King's College, making it Scotland's third-oldest university and the fifth-oldest in the English-speaking world. The university as it is today was formed in 1860 by a merger between King's College and Marischal College, a second university founded in 1593 as a Protestant alternative to the former. Today, Aberdeen is consistently ranked among the top 200 universities in the world and is one of two universities in the city, the other being the Robert Gordon University.", 'title': 'University of Aberdeen'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The National Autonomous University of Léon (Spanish: "Universidad Nacional Autónoma de Nicaragua, Léon" ), founded in 1812, is a university in Nicaragua. It was the second university founded in Central America and the last founded under the colonial rule of the Spanish Empire.', 'title': 'National Autonomous University of León'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Kristine Stiles (born Kristine Elaine Dolan in Denver, Colorado, 1947) is the France Family Professor of Art, Art History and Visual Studies at Duke University. She is an art historian, curator, and artist specializing in global contemporary art. She is best known for her scholarship on artists’ writings, performance art, feminism, destruction and violence in art, and trauma in art. Stiles joined the faculty of Duke in 1988, and she has taught at the University of Bucharest and Venice International University. She received the Richard K. Lublin Distinguished Award for Undergraduate Teaching Excellence in 1994, and the Dean’s Award for Excellence in Graduate Mentoring in 2011, both at Duke University. Among other fellowships and awards include a J. William Fulbright Fellowship in 1995, a Solomon R. Guggenheim Fellowship in 2000, and an Honorary Doctorate from Dartington College of Arts in Tontes, Devon, England in 2005.', 'title': 'Kristine Stiles'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Japan's hydrogen highway is a network of hydrogen filling stations placed along roadsides that provide fuel for hydrogen fuel cell vehicles (HFCV). An HFCV is a vehicle that uses a fuel cell to convert hydrogen energy into electrical energy. The hydrogen that is used in fuel cell vehicles can be made using fossil or renewable resources. The hydrogen highway is necessary for HFCVs to be used. HFCV reduce tailpipe emissions of greenhouse gases. By May 2016, there were approximately 80 hydrogen fueling stations in Japan.", 'title': 'Hydrogen highway (Japan)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'A hydrogen vehicle is a vehicle that uses hydrogen as its onboard fuel for motive power. Hydrogen vehicles include hydrogen fueled space rockets, as well as automobiles and other transportation vehicles. The power plants of such vehicles convert the chemical energy of hydrogen to mechanical energy either by burning hydrogen in an internal combustion engine, or by reacting hydrogen with oxygen in a fuel cell to run electric motors. Widespread use of hydrogen for fueling transportation is a key element of a proposed hydrogen economy.', 'title': 'Hydrogen vehicle'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Mazda RX-8 Hydrogen RE is a 2003 bi-fuel version of the RX-8 sports car, in which the twin-rotor wankel rotary engine is configured to run on either hydrogen or gasoline. This is the fifth Mazda vehicle to be fitted with a hydrogen wankel rotary engine. The hydrogen tank, with a capacity of 110 liters at 350 bar stores up to 2.4 kilograms of hydrogen and is fitted in addition to the 61 liter gasoline tank. In 2005, Mazda obtained street approval for this vehicle. The following year, the first vehicles were leased to customers (Idemitsu and Iwatani). In November 2007, Mazda announced the delivery of 30 RX-8 HRE to the Norwegian hydrogen project Hynor.', 'title': 'Mazda RX-8 Hydrogen RE'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'A hydrogen-powered aircraft is an aeroplane that uses hydrogen fuel as a power source. Hydrogen can either be burned in some kind of jet engine, or other kind of internal combustion engine, or can be used to power a fuel cell to generate electricity to power a propeller.', 'title': 'Hydrogen-powered aircraft'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Flexible-fuel vehicles in the United States are the second largest flex-fuel fleet in the world after Brazil, and there were about 17.4\xa0million flex-fuel cars and light trucks in operation by the end of 2014. Despite the growing fleet of E85 flex-fuel vehicles, actual use of ethanol fuel is limited due to the lack of E85 refueling infrastructure and also because many American flex-fuel car owners were not aware they owned an E85 flex-fuel vehicle. Flex-fuel vehicles are common in the Midwest, where corn is a major crop and is the primary feedstock for ethanol fuel production. Also the U.S. government has been using flex-fuel vehicles for many years.', 'title': 'Flexible-fuel vehicles in the United States'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'In thermodynamics, motive power is a natural agent, such as water or steam, wind or electricity, used to impart motion to machinery such as an engine. Motive power may also be a locomotive or a motor, which provides motive power to a system. "Motive power" may be thought of as a synonym for either "work", i.e. force times distance, or "power".', 'title': 'Motive power'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'A flexible-fuel vehicle (FFV) or dual-fuel vehicle (colloquially called a flex-fuel vehicle) is an alternative fuel vehicle with an internal combustion engine designed to run on more than one fuel, usually gasoline blended with either ethanol or methanol fuel, and both fuels are stored in the same common tank. Modern flex-fuel engines are capable of burning any proportion of the resulting blend in the combustion chamber as fuel injection and spark timing are adjusted automatically according to the actual blend detected by a fuel composition sensor. Flex-fuel vehicles are distinguished from bi-fuel vehicles, where two fuels are stored in separate tanks and the engine runs on one fuel at a time, for example, compressed natural gas (CNG), liquefied petroleum gas (LPG), or hydrogen.', 'title': 'Flexible-fuel vehicle'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The principle of a fuel cell was discovered by Christian Friedrich Schönbein in 1838, and the first fuel cell was constructed by Sir William Robert Grove in 1839. The fuel cells made at this time were most similar to today's phosphoric acid fuel cells. Most hydrogen fuel cells today are of the proton exchange membrane (PEM) type. A PEM converts the chemical energy released during the electrochemical reaction of hydrogen and oxygen into electrical energy. The Energy Policy Act of 1992 was the first national legislation that called for large-scale hydrogen research. A five-year program was conducted that investigated the production of hydrogen from renewable energy sources and the feasibility of existing natural gas pipelines to carry hydrogen. It also called for the research into hydrogen storage systems for electric vehicles and the development of fuel cells suitable to power an electric motor vehicle.", 'title': 'United States hydrogen policy'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Bi-fuel vehicles or otherwise known as dual fuel are vehicles with multifuel engines capable of running on two fuels. On internal combustion engines one fuel is gasoline or diesel, and the other is an alternate fuel such as natural gas (CNG), LPG, or hydrogen. The two fuels are stored in separate tanks and the engine runs on one fuel at a time in some cases, in others both fuels are used in unison. Bi-fuel vehicles have the capability to switch back and forth from gasoline or diesel to the other fuel, manually or automatically.', 'title': 'Bi-fuel vehicle'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'A fuel cell vehicle (FCV) or fuel cell electric vehicle (FCEV) is a type of electric vehicle which uses a fuel cell, instead of a battery, or in combination with a battery or supercapacitor, to power its on-board electric motor. Fuel cells in vehicles generate electricity to power the motor, generally using oxygen from the air and compressed hydrogen. Most fuel cell vehicles are classified as zero-emissions vehicles that emit only water and heat. As compared with internal combustion vehicles, hydrogen vehicles centralize pollutants at the site of the hydrogen production, where hydrogen is typically derived from reformed natural gas. Transporting and storing hydrogen may also create pollutants.', 'title': 'Fuel cell vehicle'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Lacona Railroad Station and Depot, also known as New York Central and Hudson River Railroad Station and Depot, is a historic railway depot located at Lacona in Oswego County, New York. It was built in 1891 by the New York Central and Hudson River Railroad. It is a small rectangular, one story, gable ended structure.', 'title': 'Lacona Railroad Station and Depot'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Ronkonkoma is a major railroad station and transportation hub along the Main Line of the Long Island Rail Road in Ronkonkoma, New York. The station is the eastern terminus of the Ronkonkoma Branch and the western terminus of the out Branch.', 'title': 'Ronkonkoma (LIRR station)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Erie Railroad Depot, Erie Railroad Station or Erie Depot was the terminal station for the Erie Railroad in Rochester, New York, designed by George E. Archer, the railroad's architect. The station opened in 1887 between the Genesee River and Exchange Street on the south side of Court St. The station was one of the Erie's few electrified railroad stations, and was one of the first stations to provide electric commuter services in 1907. In 1905 the Lehigh Valley Railroad Station opened directly across the Genesee River from the Erie Depot.", 'title': 'Erie Railroad Depot (Rochester, New York)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Jamestown Gateway Train Station, also known as the Jamestown Erie Railroad station, and the Erie-Lackawanna Railroad Station, is a historic train station located at Jamestown in Chautauqua County, New York. Although no longer an active railroad station due to a lack of passenger service in the area after a restoration done in 2011 the building currently serves as a bus transportation center and community space for Jamestown. The first train arrived at Jamestown on August 25, 1860 as part of the Atlantic and Great Western Railroad.', 'title': 'Jamestown Gateway Train Station'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The North Creek Railroad Station is a historic railroad station complex located at North Creek, Warren County, New York. The complex consists of the railroad station, the freight house, round house, turntable, and horse barn. The station was built in 1874 and is a simple, rectangular, gable roofed building with a broad, overhanging strut-supported roof in the Stick-Eastlake style. Its exterior is covered with vertical boards.', 'title': 'North Creek Railroad Station'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Ronkonkoma ( ) is a hamlet and census-designated place (CDP) on Long Island in the Town of Islip, New York, United States. The population of the CDP was 19,082 at the 2010 census.', 'title': 'Ronkonkoma, New York'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Cambridge Springs (formerly Cambridge) was a railroad station for the Erie Railroad in Cambridge Springs, Crawford County, Pennsylvania, United States. Cambridge Springs station was on the Main Line\'s Meadville Division, which was the section of the line between Salamanca, New York and Meadville, Pennsylvania. The station was located 501.2 mi from Manhattan and the Barclay Street Ferry, which connected to Pavonia Terminal in Jersey City, New Jersey and 480.8 mi from Hoboken Terminal in Hoboken, New Jersey. For nearly three decades, the station had connections to the Northwestern Pennsylvania Railway, which was a trolley line that connected the city of Erie and Meadville. Modern Erie Railroad station signage denoted the station as "Home of Alliance College," a local private university that closed in 1987.', 'title': 'Cambridge Springs (Erie Railroad station)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Dykeman\'s was a station on the Harlem Line of the New York Central Railroad (now Metro-North Railroad). It was 55 miles from Grand Central Terminal. Rail service in Dykeman\'s can be traced as far back as 1848 with the establishment of the New York and Harlem Railroad, which became part of the New York Central and Hudson River Railroad in 1864 and eventually taken over by the New York Central Railroad. Dykeman\'s was also the northern terminus of double tracks on the Harlem Line which were controlled by "Signal Station X" until 1948. The station house was replaced by a small shelter on August 6, 1961, and was closed when the New York Central merged into Penn Central in 1968. No station structures remain at the site, which the MTA replaced with Brewster North Railroad Station in 1980.', 'title': "Dykeman's (NYCRR station)"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Ridgefield Park Station, also known as West Shore Station, was railroad station in Ridgefield Park, New Jersey at the foot of Mount Vernon Street served by the New York, Susquehanna and Western Railroad (NYSW) and the West Shore Railroad, a division of New York Central (NYCRR) The New York, Ontario and Western Railway (NYO&W) had running rights along the West Shore and sometimes stopped at Ridgefield Park. First opened in 1883 it was one of three passenger stations in the village, the others being the Little Ferry Station to the south and Westview Station to the north. The station house, built at a cost $100,000 opened in 1927. Southbound service crossed Overpeck Creek and continued to terminals on the Hudson River waterfront where there was connecting ferry service across the Hudson River to Manhattan. Northbound near Bogota the parallel NYSW and West Shore lines diverge and continue into northern New Jersey, Pennsylviania, and upstate New York. Passenger service ended in 1966.', 'title': 'Ridgefield Park station'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The Hyde Park Railroad Station is the former New York Central Railroad station located where Crum Elbow Creek flows into the Hudson River in Hyde Park, New York. A one-story wooden station was first established by the Central at the spot in 1851 by the Hudson River Railroad, connecting New York City and Albany. It was replaced by the existing building, built in a combination of the Mission and Spanish Revival styles by Warren and Wetmore, the railroad's preferred architects who had also designed Grand Central Terminal and the nearby Poughkeepsie station, in 1914.", 'title': 'Hyde Park Railroad Station'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Brandon James Garbe (born February 3, 1981 in Moses Lake, Washington) is an American former minor league baseball player. In 1999, Garbe won the Gatorade High School Baseball Player of the Year Award.', 'title': 'B. J. Garbe'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Brandon James Fleming (born 3 December 1999) is an English professional footballer who plays for Championship side Hull City as a defender.', 'title': 'Brandon Fleming (footballer)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Doctor Paul Michaux (born Paul-Marie Michaux; 16 November 1854\xa0– 21 November 1923) was a French surgeon. After studying at the Paul Verlaine University\xa0– Metz, he migrated to Paris, where he actively participated in the Conférence Olivaint and later became president of the organisation. After completing an internship and thesis, his career led him into various hospitals in the city and suburbs, where he developed medical innovations and performed research. As a member of the parish patronage committee, Michaux's moral and religious beliefs led him to establish a type of gymnastics specifically intended for Christian Patriots. His enthusiasm for the sport was reflected with the foundation of the Fédération gymnastique et sportive des patronages de France in 1898, which later became the Fédération sportive et culturelle de France, the foundation of the Fédération gymnastique et sportive des patronages de France in 1898 (later the Fédération sportive et culturelle de France), an organisation which took prompt steps to support team sports (including football and basketball) as well as choral music.", 'title': 'Paul Michaux'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Pilot" is the pilot and first episode of the first season of the American horror television series, "Scream". The series is based on the American horror film franchise of the same name. The series revolves around the main character, Emma Duvall, played by Willa Fitzgerald, who lives in the town of Lakewood. She quickly becomes the center of a series of murders amongst teens who know her. The massacre seems to be related to the Brandon James murders, who was supposedly obsessed with Emma\'s mother (Tracy Middendorf).', 'title': 'Pilot (Scream)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Marcus Sedatius Severianus (Latin: "Marcus Sedatius C. f. Severianus Iulius Acer Metillius Nepos Rufinus Ti. Rutilianus Censor"; Ancient Greek: "Μ. Σηδάτιος Σεουηριανὸς"; ca. 105-161/162) was a senator, consul, and Roman general during the 2nd-century AD, originally from Gaul. Sedatius was a provincial governor and later a provincial consul. His career led up to consul "suffect" in 153. However brilliant, his career did not progress quickly through the "cursus honorum". He had to earn his way from patrician to the more prestigious senatorial order. It is distinguished through his link with the oracle of Glycon (Alexander of Abonoteichus) while its end shows the military difficulties of the Empire during the reign of Marcus Aurelius. He was governor of Cappadocia at the start of the Roman war with Parthia during which he was convinced by the untrustworthy oracle to invade Armenia in 161, although Parthia had been making trouble in Armenia since the death of the emperor Antoninus Pius (died 7 March 161). Sedatius committed suicide while under siege in the Armenian city of Elegeia, on the upper Euphrates. He was replaced as governor of Cappadocia by Marcus Statius Priscus.', 'title': 'Marcus Sedatius Severianus'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Generalleutnant Franz Walz began his military career in the infantry in 1905. In 1912, he switched to aviation. He attained the rank of Hauptmann (Captain) while becoming a flying ace during World War I. He flew more than 500 combat sorties in Palestine and upon the Western Front. He scored seven confirmed aerial victories in the latter theater. His later career led him to join the Luftwaffe during World War II. Toward the end of the war, he was captured by the Russians and died in one of their prison camps in December 1945.', 'title': 'Franz Walz'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Brandon James Williams (born February 21, 1989) is an American football defensive tackle for the Baltimore Ravens of the National Football League (NFL). He was drafted by the Ravens in the third round of the 2013 NFL Draft. He played college football at Missouri Southern.', 'title': 'Brandon Williams (defensive tackle)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Brandon James Routh (born October 9, 1979) is an American actor and former fashion model. He grew up in Iowa before moving to Los Angeles to pursue an acting career, and subsequently appeared on multiple television series throughout the early 2000s. In 2006, he gained greater recognition for his role as the titular superhero of the 2006 film "Superman Returns". He also had a recurring role in the TV series "Chuck", as Daniel Shaw. Following this, he had notable supporting roles in the films "Zack and Miri Make a Porno" and "Scott Pilgrim vs. the World". In 2014, he began a recurring role on "Arrow" as Ray Palmer/Atom which spun off into a guest role on "The Flash" and a starring role on "Legends of Tomorrow".', 'title': 'Brandon Routh'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Brian Ralston (born April 12, 1974) is a composer and musician living in Los Angeles. Ralston is a graduate of the University of Arizona and the USC Thornton School of Music Scoring for Motion Pictures and Television program. Brian\'s latest film is the 2017 drama Rose starring Cybill Shepherd, James Brolin and Pam Grier. In 2012 he scored the 20th Century Fox inspirational sports film Crooked Arrows, starring Brandon Routh, directed by Steve Rash. He has also composed music for the television series "Angel" (Season 4) and scores to the theatrical motion pictures "9/Tenths", directed by Bob Degus ("Pleasantville") starring Gabrielle Anwar, Henry Ian Cusick and Dave Ortiz, the Magnolia Pictures teen heist movie Graduation directed by Mike Mayer and starring Adam Arkin, Shannon Lucio, Chris Marquette, Riley Smith and Chris Lowell, and the dramatic feature Don\'t Fade Away directed by Luke Kasdan, starring Beau Bridges, Mischa Barton and Ryan Kwanten.', 'title': 'Brian Ralston'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Brandon James Keener (born October 1, 1974) is an American actor living in Los Angeles, California. He was born and raised in Fort Smith, Arkansas and graduated from University of Arkansas at Fayetteville, where he won an Irene Ryan scholarship for collegiate actors and performed at the Kennedy Center.', 'title': 'Brandon Keener'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Garnett Thompson is an American professional basketball player. He is from Islip, New York and initially played college basketball at Suffolk Community College. The 6\'9" Forward played college basketball with the Providence Friars. He only played at Providence University for 1 year. He has played internationally with AZS Koszalin of Poland. Thompson has played professionally in Lebanon as well. In Lebanon, he has helped the Ceders achieve success. He has played at Lebanon for 5 years. He has also found playing time in Street Basketball at the Entertainers Ball Classic at Rucker Park. He returned in 2016 to play with the Lebanese team Champville without being paid in the Henri Chalhoub Tournament, he helped his team reach the final but lost against Byblos.', 'title': 'Garnett Thompson'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The 2016–17 Pacific Tigers men's basketball team represented the University of the Pacific during the 2016–17 NCAA Division I men's basketball season. They played their home games at the Alex G. Spanos Center as members of the West Coast Conference. The Tigers were led by first-year head coach Damon Stoudamire. They finished the season 11–22, 4–14 in WCC play to finish in ninth place. They defeated Pepperdine in the first round of the WCC Tournament to advance to the quarterfinals where they lost to Gonzaga.", 'title': "2016–17 Pacific Tigers men's basketball team"}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Damon Lamon Stoudamire (born September 3, 1973) is an American retired professional basketball player and the current head men's basketball coach at the University of the Pacific. The 5 ft , 171 lb point guard was selected with the 7th overall pick by the Toronto Raptors in the 1995 NBA draft and won the 1995–96 NBA Rookie of the Year Award. He played collegiately at the University of Arizona, and professionally for the Toronto Raptors, Portland Trail Blazers, Memphis Grizzlies and San Antonio Spurs. He is the cousin of former Arizona Wildcats standout Salim Stoudamire and current NBA player Terrence Jones.", 'title': 'Damon Stoudamire'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Terrence Alexander Jones (born January 9, 1992) is an American professional basketball player for the Qingdao DoubleStar of the Chinese Basketball Association (CBA). He played college basketball for the University of Kentucky.', 'title': 'Terrence Jones'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'DeMarcus Amir Cousins (born August 13, 1990) is an American professional basketball player for the New Orleans Pelicans of the National Basketball Association (NBA). Nicknamed "Boogie", he played college basketball for the University of Kentucky, where he was an All-American in 2010. He left Kentucky after one season, and was selected with the fifth overall pick in the 2010 NBA draft by the Sacramento Kings. In his first season with the Kings, Cousins was named to the NBA All-Rookie First Team, and from 2015 to 2017, he was named an NBA All-Star. He is also a two-time gold medal winner as a member of the United States national team, winning his first in 2014 at the FIBA Basketball World Cup and his second in 2016 at the Rio Olympics.', 'title': 'DeMarcus Cousins'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The 2012–13 Memphis Tigers men's basketball team represented the University of Memphis in the 2012–13 NCAA Division I men's basketball season, the 92nd season of Tiger basketball. The Tigers were coached by head coach Josh Pastner, who was assisted by Damon Stoudamire, Jimmy Williams and Aki Collins. Stoudamire and Williams both assisted Pastner in 2011–12, and Collins left Marquette in May 2012 to join Pastner's staff. The Tigers played their home games at the FedExForum in Memphis. The 2012–13 season was the final season the Tigers participated in Conference USA before joining the American Athletic Conference in 2013–14. They finished the season 31–5, 16–0 in C-USA play to be Conference USA regular season champions. They also were champions of the Conference USA Tournament, winning the championship game in two overtimes vs Southern Miss, to earn an automatic bid to the 2013 NCAA Tournament. In the tournament, they defeated Saint Mary's in the second round before losing in the third round to Michigan State.", 'title': "2012–13 Memphis Tigers men's basketball team"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Donald Lee Haskins (March 14, 1930 – September 7, 2008), nicknamed "The Bear", was an American basketball player and coach. He played college basketball for three years under coach Henry Iba at Oklahoma A&M (now Oklahoma State University). He was the head coach at Texas Western College (renamed the University of Texas at El Paso in 1967) from 1961 to 1999. His greatest triumph occurred in 1966, when his team won the NCAA Tournament over the Wildcats of the University of Kentucky, coached by Adolph Rupp. The watershed game initiated the end of racial segregation in college basketball.', 'title': 'Don Haskins'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The University of the Pacific Tigers men's basketball team is an NCAA Division I member, part of the West Coast Conference. The team is based in Stockton, California. They play their home games at the Alex G. Spanos Center and are led by head coach Damon Stoudamire.", 'title': "Pacific Tigers men's basketball"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 2011–12 Memphis Tigers men's basketball team represented the University of Memphis in the 2011–12 college basketball season, the 91st season of Tiger basketball. The Tigers were coached by head coach Josh Pastner. Pastner was assisted by Jack Murphy and Damon Stoudamire. From the summer of 2011 until December 2011, NBA player Luke Walton was also an assistant coach, though he departed from the position with the end of the NBA lockout. Jimmy Williams was brought in to replace Walton for the remainder of the 2011–12 season. The Tigers played their home games at the FedExForum in Memphis, Tennessee and were members of Conference USA.", 'title': "2011–12 Memphis Tigers men's basketball team"}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The 1995–96 NBA season was the Toronto Raptors' first season in the National Basketball Association. The Raptors, along with the Vancouver Grizzlies, played their first games in 1995, and were the first NBA teams to play in Canada since the 1946–47 Toronto Huskies. Former Detroit Pistons star Isiah Thomas became the team's General Manager. In their debut on November 3, the Raptors defeated the New Jersey Nets at the SkyDome 94–79, but went on a 7-game losing streak afterwards. At midseason, the team acquired second-year forward Sharone Wright from the Philadelphia 76ers, and Doug Christie from the New York Knicks. The Raptors finished last place in the Central Division with a 21–61 record. Top draft pick Damon Stoudamire was named Rookie of The Year averaging 19.0 points, and 9.3 assists per game. Following the season, Tracy Murray signed as a free agent with the Washington Bullets, Oliver Miller signed with the Dallas Mavericks and Alvin Robertson retired.", 'title': '1995–96 Toronto Raptors season'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Truscon Laboratories was a research and development chemical laboratory of the Trussed Concrete Steel Company ("Truscon") of Detroit, Michigan. It made waterproofing liquid chemical products that went into or on cement and plaster. The products goals were to provide damp-proofing and waterproofing finishing for concrete and Truscon steel to guard against disintegrating action of water and air.', 'title': 'Truscon Laboratories'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Hy-Rib was a brand name for a product manufactured by the Trussed Concrete Steel Company. It is an engineering reinforcement system for floors, walls, and ceilings of buildings and houses. This product is a derivative of the Kahn Trussed Bar for beams and columns that was invented by Julius Kahn. Kahn engineered the Hy-Rib products and they were first manufactured in 1909.', 'title': 'Hy-Rib'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Frederick J. Griffiths (December 11, 1878 - October 17, 1951) was an early, English-born engineer in the Stark County, Ohio steel industry. He is best known for working with Henry Ford to develop a vanadium alloy steel in order to produce lighter-weight, stronger automobiles. When the Massillon Rolling Mill Company merged into the Central Steel Company in June 1914, Griffiths resigned as a chemist at Canton’s United Steel Company to become Central's vice president and superintendent. He then became the president of the company. His daughter, Gertrude, lit the first open hearth furnace at the new Central Steel Company in 1915. In 1917, Griffith's was named to the Massillon Steel Casting Company board of directors. The company's earliest orders came from the United States military for production of the steel-rated equipment and supplies needed for World War I. By 1919, 3 of his 5 brothers were all superintendents at Central Steel.", 'title': 'F.J. Griffiths'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Albert Kahn Associates is an architectural design firm in Detroit, Michigan with a second office located in São Paulo, Brasil. It was established in 1895 and is still active today. It introduced a new technology in industrial building involving a unique reinforced concrete method referred to as the Kahn System of construction using proprietary patented reinforcement steel manufactured by Trussed Concrete Steel Company. The building of automobile factories and other types of factories were revolutionized from wooden timber framing construction. Besides being an advanced technology in strength that led to wider open interior spaces, it featured a high degree of fire resistance and larger window space for light. The firm started by Albert Kahn built factories for Chrysler for over a decade, Ford Automobile for 30 years and Packard Automobile for 35 years. Other important clients of the firm were Republic Steel and General Motors. The firm was awarded a $40 million dollar contract to build a tractor factory in Russia in 1928. The firm's output was over a million dollars worth of work per week by 1929. By 1939, the firm designed 19 percent of all industrial buildings in the United States and had designed some $800\xa0million of buildings worldwide. Currently, Albert Kahn Associates is still making history with state-of-the-art projects. Recent projects include creating the world's largest penguin conservatory,located at the Detroit Zoo, which opened in 2016.", 'title': 'Albert Kahn Associates'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Geofeedia is a social media intelligence platform that associates social media posts with geographic locations. The company raised $3.5 million in their second round of venture capital in October 2014. At the time, major clients included the Los Angeles County Sheriff's Department and Dell. Clients could visualize posts in an area in realtime and analyze the contents. Services mined by Geofeedia include Instagram, Twitter, Periscope, Vine, YouTube, and Sina Weibo. The company raised $17 million in Series B funding in early 2016 from Silversmith Capital Partners and reported 250% revenue growth in 2015 with clients including Mall of America and the NCAA. At this time, 60 people worked for the company. In October 2016, the American Civil Liberties Union published a report that the company's technologies were used to identify and arrest protestors in events such as the 2015 Baltimore protests that followed the death of Freddie Gray. Facebook, Instagram, and Twitter, who were named in the report, restricted Geofeedia's access to user data as a result. Facebook had used the service itself to detect an intruder uploading photos taken inside the office of its CEO, Mark Zuckerberg.", 'title': 'Geofeedia'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The Trussed Concrete Steel Company was a company founded by Julius Kahn, an engineer and inventor. The company manufactured prefabricated products for reinforced concrete beams and steel forms for building reinforced concrete floors and walls. Kahn invented and patented a unique new technology reinforcement system of construction called the Kahn System that was stronger, more economical, and lighter than the existing old school technology used up to that point to construct buildings. The old method was to use plain straight smooth steel beams or loose rods or stirrups in concrete beams and floors. Kahn\'s new technology improved system used 45 degree tab flanges or "wings" permanently attached on steel beams that distributed the tension stress for overall improvement in strength of reinforced concrete.', 'title': 'Trussed Concrete Steel Company'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Benjamin Franklin Fairless (May 3, 1890 — January 1, 1962) was an American steel company executive. He was president of a wide range of steel companies during a turbulent and formative period in the American steel industry. His roles included President of Central Alloy Steel from 1928 to 1930; First Vice President of Republic Steel (which had absorbed Central Steel) from 1930 to 1935; President of the Carnegie-Illinois Steel Company from 1935 to 1938; and then President, and later Chairman of the board of directors and Chief Executive Officer of U.S. Steel (the largest steel company in the United States) from 1938 to 1955.', 'title': 'Benjamin Franklin Fairless'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Kahn was born in Münstereifel, Germany, March 8, 1874. He was raised in Detroit, Michigan. Kahn came to Detroit in 1881 from Germany with his family (five brothers and two sisters) when he was six years old, settling first in Baltimore, Maryland in 1880. His father Joseph (1860–1924) was a rabbi and ran a restaurant. Kahn helped in his father's restaurant business and sold newspapers. His mother Rosalie was skilled in music and art. Kahn went to the Detroit Public Schools where he received his elementary schooling, doing the normal four-year high school in three years.", 'title': 'Julius Kahn (inventor)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Lackawanna Steel Company was an American steel manufacturing company that existed as an independent company from 1840 to 1922, and as a subsidiary of the Bethlehem Steel company from 1922 to 1983. Founded by the Scranton family, it was once the second-largest steel company in the world (and the largest company outside the U.S. Steel trust). Scranton, Pennsylvania developed around the company's original location. When the company moved to a suburb of Buffalo, New York, in 1902, it stimulated the founding of the city of Lackawanna.", 'title': 'Lackawanna Steel Company'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Charles Martin Hall (December 6, 1863\xa0– December 27, 1914) was an American inventor, businessman, and chemist. He is best known for his invention in 1886 of an inexpensive method for producing aluminum, which became the first metal to attain widespread use since the prehistoric discovery of iron. He was one of the founders of ALCOA. Alfred E. Hunt, together with Charles Hall and a group of five other individuals including his partner at the Pittsburgh Testing Laboratory, George Hubbard Clapp, his chief chemist, W.S. Sample, Howard Lash, head of the Carbon Steel Company, Millard Hunsiker, sales manager for the Carbon Steel Company, and Robert Scott, a mill superintendent for the Carnegie Steel Company, Hunt raised $20,000 to launch the Pittsburgh Reduction Company which was later renamed Aluminum Company of America and shortened to Alcoa.', 'title': 'Charles Martin Hall'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Emiri Katō (加藤 英美里 , Katō Emiri , born November 26, 1983 in Fussa, Tokyo) is a Japanese voice actress and singer working for 81 Produce. At the 2nd Seiyu Awards, she won Best New Actress with her roles in "Powerpuff Girls Z" as Momoko Akatsutsumi/Hyper Blossom and "Lucky Star" as Kagami Hiiragi. She also shared a Best Singing Award with the rest of the "Lucky Star" girls for the theme song "Motteke! Sailor Fuku". At the 6th Seiyu Awards, she won Best Supporting Actress with roles such as Kyubey in "Puella Magi Madoka Magica", Kiko Kayanuma in "Darker Than Black", and Mey-Rin in "Black Butler". She and fellow voice actress Kaori Fukuhara were in a duo music group called Kato*Fuku, which sang theme songs for "When Supernatural Battles Became Commonplace" and "Battle Spirits Saikyo Ginga Ultimate Zero". Kato*Fuku released three albums from 2012 to 2015, and disbanded in 2016.', 'title': 'Emiri Katō'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Dexter "Dex" Manley is an American commercial and video game voice actor. He has worked under 300 commercials and 25 video games. He worked for Microsoft, Boeing Company, Alaska Airlines, and others. Dexter extensively worked for Nintendo, providing voice for many "Mario" and "Donkey Kong" games. He voiced Barry DeJay and Buddy Cheque in the Backyard Sports series, often working with his Mario colleagues Jen Taylor and Samantha Kelly, who both voiced Princess Peach. Manley also twice lent his voice talent to "Star Fox" series, voicing ROB 64 in "" and Falco Lombardi along with Peppy Hare in "Super Smash Bros. Brawl". He appeared as a host on 2005 SIGGRAPH meeting, where he discussed voice acting topics. Manley is the president of Tenacious Media, media and marketing company operating in Seattle, Washington. Dexter is also a film actor, usually filming in independent films and playing supporting roles.', 'title': 'Dex Manley'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Martin Ingerman (March 9, 1936 – October 21, 2015), known professionally as Marty Ingels, was an American actor, comedian, comedy sketch writer and theatrical agent, who is best known as the co-star of the 1960s television series" I\'m Dickens, He\'s Fenster" and for voicing Pac-Man in the 1982 Hanna-Barbera animated television series of the same name.', 'title': 'Marty Ingels'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Phantasy Star (ファンタシースター , Fantashī Sutā ) is the first installment in Sega's renowned series of the same title. It was released for the Sega Mark III/Master System, in Japan on December 20, 1987 , and then for the Master System in North America and Europe in 1988. It is considered one of the pioneers amongst role-playing video games, both for its advanced graphics technology, and for being one of the first story-driven games released in the West. It is also notable for being one of the first games featuring a female protagonist after Ms. Pac-Man.", 'title': 'Phantasy Star (video game)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'David Acord is an American sound editor and voice actor best known for his contribution as a supervising sound editor of the 2015 film "". Acord is currently pending a nomination for the Academy Award for Academy Award for Best Sound Editing and British Academy Film Award for Best Sound for his work on "The Force Awakens", with fellow sound editor Matthew Wood. He also provided the voice of several characters in the film, including the stormtrooper FN-2199 (often known as TR-8R). Though the voice role is minimal, the character gained considerable attention on the Internet following the film\'s release. Acord also had minor voice roles as an Imperial Male PA and two stormtroopers on episodes of "Star Wars Rebels".', 'title': 'David Acord'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Zork: Grand Inquisitor is a graphic adventure game developed by Activision and released for Windows in 1997, and for Macintosh in 2001. It builds upon the "Zork" and "Enchanter" series of interactive fiction video games originally released by Infocom, and sees players attempting to restore magic to Zork, solving puzzles and using spells. The game features a notable cast of characters, with stars including Erick Avari, Michael McKean, Amy D. Jacobson, Marty Ingels, Earl Boen, Jordana Capra, Dirk Benedict, and Rip Taylor. "" was written and released as a promotional prequel to the game.', 'title': 'Zork: Grand Inquisitor'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Starkiller, born Galen Marek and also known as The Apprentice, is the Dark Jedi anti-hero protagonist of the "" project. In 2014, Lucasfilm rebranded him as part of the "Star Wars Legends" non-canonical story-line, and the character has not been re-introduced yet into the "Star Wars" canon. He is raised by Darth Vader and is made his secret apprentice under the name "Starkiller" due to being potent with using the Force for destructive purposes and described as less of an assassin and more of a "Force wrecking ball". The character\'s name is taken from Luke Skywalker\'s original name, "Annikin Starkiller". The character\'s likeness and voice are provided by Samuel Witwer. Despite "The Force Unleashed" being of non-canonical "Legends" status, Witwer still remains part of the "Star Wars" canon by voicing Darth Maul in the animated series "Star Wars: The Clone Wars" and "Star Wars Rebels".', 'title': 'Starkiller'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Cory Doran (born February 7, 1982) is a Canadian voice actor and director who is known as the voice of Jimmy, the star of the animated show, "Jimmy Two-Shoes". He also voices the character Mike in the series "Total Drama". He took over for Lou Attia as the voice of Fungus in the second season of the Cartoon Network/YTV animated television series, Numb Chucks. He also provided the voice of Bummer in Cartoon Network/Teletoon series "Stoked" and Dabio in the "PBS Kids" animated series "Wild Kratts".', 'title': 'Cory Doran'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Mario Cuitláhuac Castañeda Partida (born June 29, 1962 in Irapuato, Guanajuato, Mexico), known professionally as Mario Castañeda is a Mexican voice actor and dubbing director. When he was very young, his parents moved to Mexico City where he resides currently. He studied drama in the Andrés Soler Institute from 1979 to 1982, and in June 1983, Castañeda started to work as a voice actor in Mexican dubs of several television series including Diff'rent Strokes, The Powers of Matthew Star, and The Visitor. Castañeda has also done voice work in Japanese anime, such as Son Goku in the Latin American dub of Dragon Ball Z, as well as the dubbing voice of many actors in movies, including Jim Carrey, Jackie Chan and Bruce Willis. He was also the announcer for Boomerang in Latin America from 2001 to 2006.", 'title': 'Mario Castañeda'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Edan Gross (born 1978) is an American former child actor, voice actor and former president of 3TAC Distribution, Inc.. He appeared in many guest spots on many popular television programs in the 1980s and 1990s including "Cheers", "Murphy Brown", "The Golden Girls", "Empty Nest", "Newhart", "Highway to Heaven", "Married... with Children", "Northern Exposure", and "Herman\'s Head". He was also featured as a regular on the short-lived sitcoms "Sweet Surrender" (NBC, 1987), "Free Spirit" (ABC, 1989–1990) and "Walter & Emily" (NBC, 1991–1992). Additionally, Gross was the voice of the Good Guy dolls in "Child\'s Play", the "Corky doll" from the Cricket doll series, the title character of the animated series "Little Dracula", Flounder on the animated series "The Little Mermaid" and Waif in the computer game Return to Zork. .', 'title': 'Edan Gross'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'USS "Florence Nightingale" (AP-70) was a Maritime Commission type C3-M cargo ship built as Mormacsun for Moore-McCormack Lines. "Mormacsun" operated for Moore-McCormack from May 1941 until December 1941 when she came under the War Shipping Administration (WSA) for the duration of World War II. The ship operated with Moore-McCormack as the WSA agent, playing an important role in early supply of the Southwest Pacific, until transfer to the United States Navy September 1942 and commissioning as "Florence Nightingale" whereupon she became an "Elizabeth C. Stanton"-class transport ship. She was named for Florence Nightingale (1820–1910), the nursing pioneer, and is one of the few United States Navy ships named after a woman. The ship was returned to WSA in 1946 and then to Moore-McCormack operating as "Mormacsun" until sold to operate as "Japan Transport" and lastly as "Texas".', 'title': 'USS Florence Nightingale (AP-70)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Edith Helen Paull ( \u20091903 –1975) was an Indian medical nurse from Uttar Pradesh associated with the Indian Red Cross Society. She did her nursing studies at Bedford College, London, with the assistance of a Florence Nightingale scholarship and started her career in 1928. She held the post of the nursing matron at many renowned medical institutions such as the Lady Hardinge Medical College Hospital, New Delhi, the Government Civil Hospital, Allahabad, Gokuldas Tejpal Hospital, Mumbai and Jehangir Hospital, Pune and presided the Trained Nurses Association of India for six years. A winner of the Florence Nightingale Medal in 1964, she was honoured by the Government of India in 1967, with the award of Padma Shri, the fourth-highest Indian civilian award for her contributions to the society.', 'title': 'Edith Helen Paull'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Florence Nightingale was a 60-minute 2008 BBC One television drama on the early years of Florence Nightingale, from 1837 to the Royal Commission into the Crimean War. Nightingale was played by Laura Fraser, and her father by Michael Pennington. It was first broadcast on Sunday 1 June 2008.', 'title': 'Florence Nightingale (2008 film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Nursing in the United Kingdom has a long history. The current form of nursing is often considered as beginning with Florence Nightingale who pioneered 'modern nursing'. Florence Nightingale initiated formal schools of nursing in the United Kingdom in the late 19th and early 20th centuries. The role and perception of nursing has dramatically changed from that of 'handmaiden' to the doctor to professionals in their own right. There are over 300,000 nurses in the United Kingdom and they work in a variety of settings; hospitals, health centres, nursing homes, hospices, communities, academia etc. with most nurses working for the National Health Service (NHS). Nurses work across all demographics and requirements of the public; Adults and Children and mental health. Nurses work in a range of specialties from the broad areas of medicine, surgery, theatres, investigative sciences such as imaging, neo-natal etc. Nurses also work in a large areas of sub-specialities such as respiratory, diabetes, neurology, infectious diseases, liver, research, cardiac etc. Nurses often work in multi-disciplinary teams but increasingly are found working independently.", 'title': 'Nursing in the United Kingdom'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Florence Nightingale Foundation (FNF) is a charity organisation in the United Kingdom that provides scholarships to nurses, midwives and other health professionals while serving as a living memorial of the work of Florence Nightingale.', 'title': 'Florence Nightingale Foundation'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Jerry Barrett (1824–1906) was an English painter of the Victorian era. His most notable work was the Crimean War depiction ""The Mission of Mercy: Nightingale receiving the wounded at Scutari"" (1858) which is in the National Portrait Gallery (London), paired with ""Queen Victoria\'s First Visit to her Wounded Soldiers"". There is documentation to suggest that Barrett traveled to the Crimea to obtain sketches for his pictures. "Queen Victoria\'s First Visit to Her Wounded Soldiers" was exhibited at the Royal Exhibition Gallery in Piccadilly in May, 1856, and engraved by Agnews. It was Thomas Agnew who purchased "The Mission of Mercy" from the artist in August 1857, and exhibited it at Leggatt and Hayward Gallery in Cornhill in the summer of 1858 at the height of the Indian Mutiny.', 'title': 'Jerry Barrett'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Florence Nightingale, ( ; 12 May 1820\xa0– 13 August 1910) was an English social reformer and statistician, and the founder of modern nursing.', 'title': 'Florence Nightingale'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Embley Park, in Wellow (near Romsey, Hampshire) was the family home of Florence Nightingale from 1825 until her death in 1910. It is also where Florence Nightingale claimed she had received her divine calling from God. It is now the location of Hampshire Collegiate School, a co-educational independent school for 3 -18 year olds.', 'title': 'Embley Park'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Florence Nightingale is a 1915 British silent historical film directed by Maurice Elvey and starring Elisabeth Risdon, Fred Groves and A.V. Bramble. The film portrays the life of Florence Nightingale, particularly her innovations in nursing during the Crimean War (1854-56). The film was based on Edward Tyas Cook's biography of Nightingale.", 'title': 'Florence Nightingale (1915 film)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Notes on Nursing: What it is and What it is Not is a book first published by Florence Nightingale in 1859. A 76-page volume with 3 page appendix published by Harrison of Pall Mall, it was intended to give hints on nursing to those entrusted with the health of others. Florence Nightingale stressed that it was not meant to be a comprehensive guide from which to teach one's self to be a nurse but to help in the practice of treating others.", 'title': 'Notes on Nursing'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The following is an incomplete list of classical music festivals, which encapsulates music festivals focused on classical music. Classical music is art music produced or rooted in the traditions of Western music (both liturgical and secular), and has long been played at festival-like settings. It encompasses a broad span of time from roughly the 11th century to the present day. The major time divisions of classical music are as follows: the early music period, which includes the Medieval (500–1400) and the Renaissance (1400–1600) era, played at early music festivals; the common practice period, which includes the Baroque (1600–1750), Classical (1750–1830), and Romantic eras (1804–1910), which included opera festivals and choral festivals; and the 20th century (1901–2000) which includes the modern (1890–1930) that overlaps from the late 19th-century, the high modern (mid 20th-century), and contemporary classical music festivals or postmodern (1975–2000) eras, the last of which overlaps into the 21st-century. The term "classical music" did not appear until the early 19th century, in an attempt to distinctly canonize the period from Johann Sebastian Bach to Beethoven as a golden age.', 'title': 'List of classical music festivals'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Ludwig van Beethoven ( , ; ] ; baptised 17\xa0December 177026\xa0March 1827) was a German composer and pianist. A crucial figure in the transition between the Classical and Romantic eras in Western art music, he remains one of the most famous and influential of all composers. His best-known compositions include 9 symphonies, 5 piano concertos, 1 violin concerto, 32 piano sonatas, 16 string quartets, his great Mass the "Missa solemnis", and one opera, "Fidelio".', 'title': 'Ludwig van Beethoven'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Piano Sonata No. 12 in F major by Wolfgang Amadeus Mozart, K. 332/300k, was written at the same time as the Piano Sonata, K. 330, and Piano Sonata, K. 331 ("Alla turca"), Mozart numbering them as a set from one to three. They were once believed to have been written in the late 1770s in Paris, but it is now thought more likely that they date from 1783, by which time Mozart had moved to Vienna. Some believe that Mozart wrote this and the other sonatas during a summer 1783 visit to Salzburg made for the purpose of introducing his wife, Constanze to his father, Leopold. All three sonatas were published in Vienna in 1784.', 'title': 'Piano Sonata No. 12 (Mozart)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Classical music is art music produced or rooted in the traditions of Western music, including both liturgical (religious) and secular music. While a more accurate term is also used to refer to the period from 1750 to 1820 (the Classical period), this article is about the broad span of time from before the 6th century AD to the present day, which includes the Classical period and various other periods. The central norms of this tradition became codified between 1550 and 1900, which is known as the common-practice period. The major time divisions of Western art music are as follows:', 'title': 'Classical music'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Assaf Shelleg (Hebrew: אסף שלג\u200e \u200e ), is a musicologist and pianist, a senior lecturer of musicology at The Hebrew University of Jerusalem. He was previously the Schusterman Visiting Assistant Professor of Musicology and Jewish Studies in the Department of Religious Studies at the University of Virginia (2011–14), and had taught prior to that as the visiting Efroymson Scholar in the Jewish, Islamic & Near Eastern Languages and Cultures Department at Washington University in St. Louis (2009–11). Shelleg specializes in twentieth-century Jewish and Israeli art music and has published in some of the leading journals in both musicology and Israel Studies on topics ranging from the historiography of modern Jewish art music to the theological networks of Israeli art music. Shelleg\'s book, "Jewish Contiguities and the Soundtrack of Israeli History", appeared in November 2014 with Oxford University Press. The book studies the emergence of modern Jewish art music in central and Western Europe (1910s-1930s) and its translocation to Palestine/Israel (1930s-1970s), exposing the legacies of European antisemitism and religious Judaism in the making of Israeli art music. Moving to consider the dislocation of modern Jewish art music the book examines the paradoxes embedded in a Zionist national culture whose rhetoric negated its pasts, only to mask process of hybridizations enchained by older legacies. "Jewish Contiguities" has won the 2015 Engle Prize for the study of Hebrew Music, and the 2016 Jordan Schnitzer Book Award.', 'title': 'Assaf Shelleg'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Piano Sonata, sometimes also referred to as Sonata for Piano or in its original French form, Sonate pour piano, is a 1924 piano sonata by Russian composer Igor Stravinsky.', 'title': 'Piano Sonata (Stravinsky)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Ludwig van Beethoven\'s Piano Sonata No. 29 in B♭ major, Op. 106 (known as the "Große Sonate für das Hammerklavier", or more simply as the "Hammerklavier") is a piano sonata widely viewed as one of the most important works of the composer\'s third period and among the greatest piano sonatas. Completed in 1818, it is often considered to be Beethoven\'s most technically challenging piano composition and one of the most demanding solo works in the classical piano repertoire.', 'title': 'Piano Sonata No. 29 (Beethoven)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Ludwig van Beethoven\'s Piano Sonata No. 16 in G major, Op. 31 No. 1, was composed between 1801 and 1802. Although it was numbered as the first piece in the trio of piano sonatas which were published as Opus 31 in 1803, Beethoven actually finished it after the Op. 31 No. 2, the "Tempest Sonata".', 'title': 'Piano Sonata No. 16 (Beethoven)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Double-function form is a musical construction that allows for a collection of movements to be viewed as elements of a single larger musical form. The most famous example of this is Franz Liszt’s Piano Sonata in B minor (1853). The sonata is composed as a single movement with about a half an hour’s duration. The piece introduces some themes at the very outset of the piece which are manipulated and recapitulated over twenty minutes later. Charles Rosen believes that the work as whole fulfils his criterion for a sonata form. Moreover, within the one long sonata form, there exists a short sonata form, followed by a slow ternary, followed by a scherzo and fugue, followed by a finale. Thus, the single movement fulfills the standard of both a classical sonata form and a classical four movement piano sonata.', 'title': 'Double-Function Form'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The Piano Sonata No.\xa03 in F minor, Op.\xa05 of Johannes Brahms was written in 1853 and published the following year. The sonata is unusually large, consisting of five movements, as opposed to the traditional three or four. When he wrote this piano sonata, the genre was seen by many to be past its heyday. Brahms, enamored of Beethoven and the classical style, composed Piano Sonata No.\xa03 with a masterful combination of free Romantic spirit and strict classical architecture. As a further testament to Brahms' affinity for Beethoven, the Piano Sonata is infused with the instantly recognizable motive from Beethoven's Symphony No.\xa05 during the first, third, and fourth movements. Composed in Düsseldorf, it marks the end of his cycle of three sonatas, and was presented to Robert Schumann in November of that year; it was the last work that Brahms submitted to Schumann for commentary. Brahms was barely 20 years old at its composition. The piece is dedicated to Countess Ida von Hohenthal of Leipzig.", 'title': 'Piano Sonata No. 3 (Brahms)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Norfolk Spaniel or Shropshire Spaniel is an extinct breed of dog since the early 20th century. It was originally thought to have originated from the work of one of the Dukes of Norfolk, but this theory was disproven after being in doubt during the later part of the 19th century. The term was used to designate springer type spaniels that were neither Sussex nor Clumber Spaniels, and attempts were made to use it to specify a breed that would later become known as the English Springer Spaniel.', 'title': 'Norfolk Spaniel'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The German Spitz Klein is a breed of dog of the German Spitz type. They are usually classed as a toy or utility breed.', 'title': 'German Spitz (Klein)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The American Cocker Spaniel is a breed of sporting dog. It is a spaniel type dog that is closely related to the English Cocker Spaniel; the two breeds diverged during the 20th century due to differing breed standards in America and the UK. In the United States, the breed is usually called the Cocker Spaniel, while elsewhere in the world, it is called the American Cocker Spaniel in order to differentiate between it and its English cousin, which was already known as "Cocker Spaniel" before the American variety was created. The word "cocker" is commonly held to stem from their use to hunt woodcock in England, while "spaniel" is thought to be derived from the type\'s origins in Spain.', 'title': 'American Cocker Spaniel'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The English Springer Spaniel is a breed of gun dog in the Spaniel family traditionally used for flushing and retrieving game. It is an affectionate, excitable breed with a typical lifespan of twelve to fourteen years. They are very similar to the Welsh Springer Spaniel and are descended from the Norfolk or Shropshire Spaniels of the mid-19th century; the breed has diverged into separate show and working lines. The breed suffers from average health complaints. The show-bred version of the breed has been linked to "rage syndrome", although the disorder is very rare. It is closely related to the Welsh Springer Spaniel and very closely to the English Cocker Spaniel; less than a century ago, springers and cockers would come from the same litter. The smaller "cockers" hunted woodcock while the larger littermates were used to flush, or "spring," game. In 1902, The Kennel Club recognized the English Springer Spaniel as a distinct breed. They are used as sniffer dogs on a widespread basis. The term "Springer" comes from the historic hunting role, where the dog would flush (spring) birds into the air.', 'title': 'English Springer Spaniel'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The American Eskimo Dog is a breed of companion dog originating in Germany. The American Eskimo is a member of the Spitz family. The breed\'s progenitors were German Spitz, but due to anti-German prejudice during the First World War, it was renamed "American Eskimo Dog". Although modern American Eskimos have been exported as German Spitz Gross (or Mittel, depending on the dog\'s height), the breeds have diverged and the standards are significantly different. In addition to serving as a watchdog and companion, the American Eskimo Dog also achieved a high degree of popularity in the United States in the 1930s and 1940s as a circus performer.', 'title': 'American Eskimo Dog'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Pomeranian (often known as a Pom or Pom Pom) is a breed of dog of the Spitz type that is named for the Pomerania region in Germany and Poland in Central Europe. Classed as a toy dog breed because of its small size, the Pomeranian is descended from the larger Spitz type dogs, specifically the German Spitz. It has been determined by the Fédération Cynologique Internationale to be part of the German Spitz breed; and in many countries, they are known as the Zwergspitz ("Dwarf-Spitz").', 'title': 'Pomeranian (dog)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Picardy Spaniel is a breed of dog developed in France for use as a gundog. It is related to the Blue Picardy Spaniel, and still has many similarities, but the Picardy Spaniel is the older of the two breeds. It is thought to be one of the two oldest continental spaniel breeds and was favoured by the French nobility, remaining popular for hunting after the French Revolution due to its weather resistant coat that enabled it to hunt in a variety of conditions and terrain. However its popularity waned following the influx of English hunting breeds in the early 20th century. Slightly smaller than an English Setter but larger than most of its spaniel cousins, it has no major health issues although as with many breeds with pendulous ears, it can be prone to ear infections.', 'title': 'Picardy Spaniel'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Welsh Springer Spaniel is a breed of dog and a member of the spaniel family. Thought to be comparable to the old Land Spaniel, they are similar to the English Springer Spaniel and historically have been referred to as both the Welsh Spaniel and the Welsh Cocker Spaniel. They were relatively unknown until a succession of victories in dog trials by the breed increased its popularity. Following recognition by The Kennel Club in 1902, the breed gained the modern name of Welsh Springer Spaniel. The breed's coat only comes in a single colour combination of white with red markings, usually in a piebald pattern. Loyal and affectionate, they can become very attached to family members and are wary of strangers. Health conditions are limited to those common among many breeds of dog, although they are affected more than average by hip dysplasia and some eye conditions. They are a working dog, bred for hunting, and while not as rare as some varieties of spaniel, they are rarer than the more widely known English Springer Spaniel with which they are sometimes confused.", 'title': 'Welsh Springer Spaniel'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'German Spitz is used to refer to both a breed of dog and category or type of dog. Several modern breeds have been developed from the German Spitz, and are either registered as separate breeds or as varieties of German Spitz. All the "German Spitz type" dogs are dogs of the Spitz type of German origin. The Großspitz, Mittelspitz, and Kleinspitz breeds of "German Spitz type" are also called the German Spitz in English.', 'title': 'German Spitz'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The King Charles Spaniel (also known as the English Toy Spaniel) is a small dog breed of the spaniel type. In 1903, the Kennel Club combined four separate toy spaniel breeds under this single title. The other varieties merged into this breed were the Blenheim, Ruby and Prince Charles Spaniels, each of which contributed one of the four colours available in the breed.', 'title': 'King Charles Spaniel'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Son of Zorn is an American live-action/animated sitcom television series created by Reed Agnew and Eli Jorné. It aired on Fox from September 11, 2016, to February 19, 2017. The series stars Cheryl Hines, Johnny Pemberton, Tim Meadows, Artemis Pebdani, and Jason Sudeikis as the voice of Zorn.', 'title': 'Son of Zorn'}
