 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Meshach Taylor (April 11, 1947 – June 28, 2014) was an American actor. He was Emmy-nominated for his role as Anthony Bouvier on the CBS sitcom "Designing Women" (1986–93). He was also known for his portrayal of Hollywood Montrose, a flamboyant window dresser in "Mannequin". He played Sheldon Baylor on the CBS sitcom "Dave\'s World" (1993–97), appeared as Tony on the short-lived NBC sitcom "Buffalo Bill" opposite Dabney Coleman, and appeared as the recurring character Alastair Wright, the social studies teacher and later school principal, on Nickelodeon\'s sitcom, "Ned\'s Declassified School Survival Guide".', 'title': 'Meshach Taylor'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Superstore is an American single-camera sitcom television series that premiered on NBC on November 30, 2015. The series was created by Justin Spitzer, who also serves as an executive producer. Starring America Ferrera (who also serves as a producer) and Ben Feldman, "Superstore" follows a group of employees working at "Cloud 9", store number 1217, a fictional big-box store in St. Louis, Missouri. The ensemble and supporting cast features Lauren Ash, Colton Dunn, Nico Santos, Nichole Bloom, and Mark McKinney.', 'title': 'Superstore (TV series)'}
