 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Nick Zano (born March 8, 1978) is an American actor and producer. He is best known for having played Vince in The WB\'s sitcom "What I Like About You". He got his big break on MTV, where he hosted that network\'s former infotainment program about the film industry, "Movie House", and briefly worked as an MTV News correspondent before he began an acting career. His recurring roles on television include Drew Pragin on "Melrose Place", Josh on "Cougar Town", Pete on "Happy Endings", P.J. Hillingsbrook on "90210", and Johnny on "2 Broke Girls". He also starred as a lead on the NBC sitcom "One Big Happy" and as Arthur in the TV series "Minority Report". He currently stars as Dr. Nate Heywood/Steel on The CW show "Legends of Tomorrow".', 'title': 'Nick Zano'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Lea Katherine Thompson (born May 31, 1961) is an American actress, television director, and television producer. She is known for her role as Lorraine Baines in the "Back to the Future" trilogy and as the title character in the 1990s NBC sitcom "Caroline in the City". Other films for which she is known include "All the Right Moves" (1983), "Red Dawn" (1984), "Howard the Duck" (1986) "Some Kind of Wonderful" (1987), and "The Beverly Hillbillies" (1993). From 2011-2017, she co-starred as Kathryn Kennish in the Freeform (formerly ABC Family) series "Switched at Birth".', 'title': 'Lea Thompson'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Bo Brady is a fictional character on the NBC soap opera, "Days of Our Lives", the youngest of the series\' Brady family. Created under head-writer Margaret DePriest, the role was originated by Peter Reckell on May 3, 1983. Reckell left the show alongside Kristian Alfonso who played Bo\'s wife Hope Williams Brady on April 20, 1987. Reckell returned from April 19, 1990, to January 17, 1992, when Robert Kelker-Kelly stepped into the role from March 13, 1992, to July 24, 1995. Reckell returned to portray Bo on August 1, 1995. In June 2012, after much speculation, it was confirmed that Reckell would once again exit the soap. Reckell filmed his final scenes for "Days of our Lives" on July 24, 2012, last airing on October 30. It was announced on March 18, 2015, that Reckell has inked a deal to return for the show\'s fiftieth anniversary, airing on August 28, 2015. In May 2016, it was announced that Reckell would return for a special episode centered around Hope, airing on June 7 and 8, 2016.', 'title': 'Bo Brady'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Edward Bridge "Ted" Danson III (born December 29, 1947) is an American actor, author, and producer well known for his role as lead character Sam Malone on the NBC sitcom "Cheers" and for his role as Dr. John Becker on the CBS sitcom "Becker". He also starred in the CBS dramas "" and "" as D.B. Russell. He also plays a recurring role on Larry David\'s HBO sitcom "Curb Your Enthusiasm", starred alongside Glenn Close in legal drama "Damages", and was a regular on the HBO comedy series "Bored to Death". In 2015 he starred as Hank Larsson in the second season of FX\'s black comedy-crime drama anthology "Fargo". Since 2016, he has played the afterlife "architect" Michael in the NBC sitcom "The Good Place.', 'title': 'Ted Danson'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Julia Benjamin (born February 21, 1957) is a retired American film and television actress of the 1960s, 1970s and 1980s. She is best remembered for her character role as Susie Baxter, the daughter of Steve and Barbara Baxter and the first cousin of Harold "Sport" Baxter on the 1960s sitcom "Hazel." Benjamin was also well known for her roles in the movies "Mr. and Mrs. Bo Jo Jones" and "The Jordan Chance." Benjamin\'s career began at the age of eight on "Hazel" in 1965. "Hazel" was a sitcom that first aired in 1961 on NBC. The series centered on the Baxter family. The family included husband George Baxter, (Don DeFore), his wife Dorothy Baxter, (Whitney Blake) and their only child, son Harold "Sport" Baxter, (Bobby Buntrock). At the end of the 1964-65 television season, NBC canceled the series. CBS decided to pick it up for a fifth season. CBS cast Ray Fulmer, Lynn Borden, and Benjamin as George Baxter\'s brother Steve, his wife Barbara and their daughter Susie. The premise of the fifth season was that George and Dorothy had to move to the Middle East as part of a job promotion. So, Hazel and Harold moved in with Steve, Barbara, and Susie. The series was cancelled by CBS airing its last episode on April 11, 1966. It was never picked up again. After Hazel, Benjamin would only get roles in a limited few number of movies and guest starring roles on television. After Hazel went off the air, Benjamin would have only five roles in movies and television. Her television credits include three guest starring roles on the television shows "My Three Sons," "The Rockford Files" and "Riptide." Her movie credits include two TV movies; "Mr. and Mrs. Bo Jo Jones" (1971), and "The Jordan Chance" (1978). "Riptide" was Benjamin\'s last acting appearance. She has not acted in anything since.', 'title': 'Julia Benjamin'}]

