 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Matt\'s Mood is the 2004 "temporary comeback" album by UK outfit Matt Bianco, released for Universal, and distributed by the Emarcy label. The album makes heavy use of Danny White and Basia Trzetrzelewska\'s signature harmonies. The two rejoined the band after twenty years (only to leave shortly after the end of the promotional world tour to revitalise their own career under the joint name of Basia). The third member on this installation of Matt Bianco is vocalist and composer Mark Reilly, whom many identify as the face of the band, being the only one constant member since its inception in 1983. This album attempted to sound similar to "Whose Side Are You On? ", which spawned a number of popular hit singles in the 1980s.', 'title': "Matt's Mood"}
