 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Ameibo is a web-based video on demand (VOD) company that allows its users to legally download and share movies with other paying customers. It is the only website in the world that pays you cold hard cash when you legally share/seed the movies you Buy or Rent from the website. The company aims to combat online movie piracy by imitating the common BitTorrent (protocol) technique as a way for users to only share the content with other paying users.', 'title': 'Ameibo'}
