 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'House of Heroes is an alternative rock band from Columbus, Ohio. They have released six albums: "What You Want Is Now" (2003), "House of Heroes" (2005), "The End Is Not the End" (2008), "Suburba" (2010), "Cold Hard Want" (2012), and "Colors" (2016). The band also released the album "Ten Months" (2001) under their original name, No Tagbacks, which had more of a punk sound than their releases as House of Heroes. They also re-released their self-titled record under the name of "Say No More" (2006). The band is composed of Tim Skipper, Colin Rigsby, A.J. Babcock, and Eric Newcomer.', 'title': 'House of Heroes'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Rollover DJ" is the second single (except in the United States, where it was the third, after "Cold Hard Bitch") by the Australian rock band Jet, from their debut album "Get Born" (14 September 2003). It was released in November, two months after the album, and was promoted with two different music videos. It reached the Top\xa040 on both the ARIA Singles Chart and the UK Singles Chart.', 'title': 'Rollover DJ'}
