[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Best Of – LaFee is the first greatest hits compilation from German rock singer LaFee. The album was released on 27 November 2009 by Capitol Records and EMI. The release will be in two different editions, "Die Tag Edition" and "Die Nacht Edition". "Die Tag Edition" will feature one CD of all singles as well some album tracks and b-sides. While the "Die Nacht Edition" has a second CD which features the most of the remaining b-sides as well some more album tracks taken from both her English and German albums.', 'title': 'Best Of – LaFee'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Best Hits is the second greatest hits album, and seventh overall release, from pop singer Enrique Iglesias. The album was released by Fonovisa after Iglesias had left them, and is the second of three compilation releases made available following his departure. The collection includes a number of album tracks and popular singles, although due to the release of "Bailamos Greatest Hits" a few months prior, failed to sell highly in the United States or Latin America. Unlike its predecessor, the album contains more singles than album tracks, and could be seen as more of a greatest hits than "Bailamos Greatest Hits". The album was certified gold in u.s for sales of 500,000 copies.', 'title': 'The Best Hits (Enrique Iglesias album)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Cheers (Drink to That)" is a song recorded by Barbadian recording artist Rihanna, from her fifth studio album, "Loud" (2010). The song impacted US mainstream and rhythmic radio on August 2, 2011, as the seventh and final single released from "Loud". The song was written by Andrew Harr, Jermaine Jackson, Stacy Barthe, LP, Corey Gibson, Chris Ivery, Lauren Christy, Graham Edwards, Avril Lavigne and Scott Spock, while production of the song was completed by Harr and Jackson under their stage name, The Runners. The song also contains samples from Lavigne\'s song "I\'m with You", which is featured on her debut album "Let Go" (2002). Lyrically, "Cheers (Drink to That)" is a party-drinking song, with multiple references to drinking alcohol, including Jameson Irish Whiskey.', 'title': 'Cheers (Drink to That)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Adore You" is a song recorded by American recording artist Miley Cyrus. It is the opening track of her fourth studio album "Bangerz" (2013) and was released as its third and final single on December 17, 2013 by RCA Records. The song was written and produced by Oren Yoel, with additional songwriting provided by Stacy Barthe. "Adore You" is a pop and contemporary R&B ballad in which Cyrus discusses her affection towards her boyfriend.', 'title': 'Adore You'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Love in the Future is the fourth studio album by American singer John Legend. The album was released on August 30, 2013. The album, executive produced by Legend, Kanye West and Dave Tozer, features guest appearances from Kimbra, Rick Ross, Stacy Barthe and Seal. The album was supported by four official singles, "Who Do We Think We Are", "Made to Love", "All of Me" and "You & I (Nobody in the World)". Upon its release "Love in the Future" received generally positive reviews from music critics. The album debuted at number four on the US "Billboard" 200 chart, selling 68,000 copies in its first week.', 'title': 'Love in the Future'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Greatest Hits & More is the first compilation album by Greek-Swedish recording artist Helena Paparizou, released in Greece and Cyprus by Sony Music Greece/RCA on 23 May 2011, although it became available through some retailers as early as 20 May. The album is a three disc set containing 52 tracks since the start of her solo career (since 2003), spanning five studio albums: "Protereotita" (2004), "Iparhi Logos" (2006), "The Game of Love" (2006), "Vrisko To Logo Na Zo" (2008), and "Giro Apo T\' Oneiro" (2010). Although marketed as a greatest hits album, it contains all of Paparizou\'s regularly released singles, including some of their English versions, rather than a selective collection of the best performing songs, as well as several promotional singles and album tracks that have never officially been released to radios. The first disc is mostly a collection of her regularly released solo singles; the second is split into three sections: "International" containing English-language songs, "B-Sides" containing mostly album tracks (none of which are b-sides), and "Covers"; the third is split into "New Songs" featuring "Baby It\'s Over" and "Love Me Crazy", "Bonus Tracks" with four remixes of the former and a Greek-language version of the latter entitled "Oti Niotho Den Allazei", and finally "Duets", showcasing her work as a featured artist.', 'title': 'Greatest Hits &amp; More (Elena Paparizou album)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Best of Suede is a compilation album by English alternative rock band Suede, released in November 2010. The compilation spans two discs and it is a mix of singles, album tracks and B-sides compiled by lead singer Brett Anderson. Disc one includes all of the band\'s singles excluding "Positivity" and "Attitude". Disc two includes album tracks from the band\'s first three albums as well as seven B-sides from disc one of "Sci-Fi Lullabies". Both Anderson and former guitarist Bernard Butler were involved in the remastering of the tracks with Chris Potter. The cover artwork is designed by Elizabeth Peyton.', 'title': 'The Best of Suede'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Stacy Barthe (born July 19, 1985) is an American singer-songwriter from Brooklyn, New York City, New York. She is a Grammy-nominated songwriter and signed a publishing deal to Universal Music Publishing Group by Ethiopia Habtermariam, in 2007. Soon after, Barthe would land her first placement, "Blur", on Britney Spears "Circus" album. Barthe has worked with artists such as Akon, Melanie Fiona, Estelle, Brandy and Sean "Diddy" Combs. Penning album tracks for Katy Perry ("Hummingbird Heartbeat"), Kelly Rowland ("Everywhere You Go") and Rihanna ("Cheers (Drink to That)"), the latter of which hit number seven on "Billboard"\'s Hot 100. She has also worked with high-profile producers Hit-Boy, Cool and Dre, The Runners, Jerry \'Wonder\' Duplessis, Supa Dups, Danja (producer), Dapo Torimiro and Tricky Stewart, among others.', 'title': 'Stacy Barthe'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Katheryn Elizabeth Hudson (born October 25, 1984), known professionally as Katy Perry, is an American singer and songwriter. After singing in church during her childhood, she pursued a career in gospel music as a teenager. Perry signed with Red Hill Records and released her debut studio album "Katy Hudson" under her birth name in 2001, which was commercially unsuccessful. She moved to Los Angeles the following year to venture into secular music after Red Hill ceased operations and she subsequently began working with producers Glen Ballard, Dr. Luke, and Max Martin. After adopting the stage name Katy Perry and being dropped by The Island Def Jam Music Group and Columbia Records, she signed a recording contract with Capitol Records in April 2007.', 'title': 'Katy Perry'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Hummingbird Heartbeat" is a song recorded by American singer Katy Perry for her third studio album, "Teenage Dream" (2010). It was written by Perry, Christopher "Tricky" Stewart, Stacy Barthe, and Monte Neuble. Stewart handled the production of the song, while Kuk Harrell produced Perry\'s vocals. "Hummingbird Heartbeat" was inspired by Perry\'s boyfriend at the time, Russell Brand. Musically, it is a 1980s-styled hard rock song that contains a mixture of elements from rock and electronica. Lyrically, the song compares the feeling of being in love to the speed of a hummingbird\'s heartbeat.', 'title': 'Hummingbird Heartbeat'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Code Red is the ninth studio album by German thrash metal band Sodom, released on 31 May 1999 by Drakkar Entertainment. On this album, Sodom returned to classic thrash metal which pleased many fans. It was also released as a two-disc limited edition with a Sodom tribute album called "Homage to the Gods" and as a two-disc edition with an Onkel Tom Angelripper\'s album called "Ich glaub´nicht an den Weihnachtsmann".', 'title': 'Code Red (Sodom album)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Band of Holy Joy are an English band formed in New Cross, London, and initially active between 1984 and 1993, releasing several albums. In 1992, they abbreviated their name to Holy Joy. They reformed in 2002, under their original name, releasing a new album called "Love Never Fails". They concentrated on other musical projects during 2003 to 2006. The band began performing live again in 2007 and have since released a number of albums, including "How To Kill A Butterfly" in 2011, a limited edition double cassette "City of Tales, Volume 1 and 2" in 2013 and "Easy Listening" in 2014. A new album entitled "The Land Of Holy Joy" was released in September 2015.', 'title': 'The Band of Holy Joy'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Welcome Interstate Managers is the third studio album by the American rock band Fountains of Wayne. It was released by S-Curve Records on June 10, 2003.', 'title': 'Welcome Interstate Managers'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Jody Porter is an American musician. He is the guitarist of Grammy Award-nominated power pop band Fountains of Wayne. The band has released four major label albums, including "Welcome Interstate Managers" on Virgin Records in 2003, an RIAA-certified Gold LP. The album spawned the hugely popular U.S. Top 40 hit and number 1 music video "Stacy\'s Mom".', 'title': 'Jody Porter'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Honey Claws is an American electronic, experimental, hip hop band formed in Austin, Texas in 2008. The band has released three albums and one EP, the first album self-titled "Honey Claws" was released in 2008. They released a second album called "Money Jaws" in 2012. Their most recent album "One Law" was released in 2014.', 'title': 'Honey Claws'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Zenji Flava is a common nickname for Zanzibari hip hop, a genre that began to develop in the 1990s. Cool Para said to be the first rapper to pioneer Zenji Flava during the 90s. He was using Saleh Jabri\'s tape to rap on some local shows in Zanzibar until 1996 when he teamed-up with another rapper named Cool Muza together with others they formed a rap group called "Struggling Islanders. They made their debut single "Historia" in early 1997. Though the group short-lived and Cool Para and Muza both went to pursue a solo career. Cool Para was the first rapper in Zanzibar and Tanzania mainland to make rap and taarab fusion called taarap. With it he went to record a song with the most prominent taarab music band widely known as the East African Melody Modern Taarab, the song was known as "Loo Umezoea" which was released early 2000. He also did "Kwenye Mataa" with the same taarab band in 1998. Before Cool Para, there was also another short-lived crew named Contish. The group consisted with two members Abdul and Hakim. They released their only album called "Mabishoo" (93). The album was available all over Zanzibar and Tanzania. They were using Swahili lyrics over ragga instrumentals such as \'Tingaling\' by Shabba Ranks. Sam,e style as Saleh J. Sometimes later they disbanded and Kim went on pursue a solo and released an album called Kim Pekee. Abdul went to live abroad. The name is made of "zenji", which is slang for "Zanzibar", and "flava", which is a corruption of "flavour", thus meaning "of Zanzibari taste". As with bongo flava, i.e., Tanzanian mainland\'s hip hop, zenji flava is usually sung in swahili; the main difference between the two subgenres is that Zanzibari hip hop also reflects some influence of taarab, and thus indirectly of Arab music and Indian music. Notable zenji flava artists include Ali Haji. As Zenji flavour goes on it find itself as a sub part of Bongo flava as it has influence from the young generation of artists who want to cop with Bongo flava. like Offside trick, 2 berry now is separated to form two solo artists（Berry black and Berry white）, Wazenji kijiwe and Shaka zulu, others are East connection which was made up with almost seven groups of artist including Offside trick Brooklyn, Four nature, Jumbo camp, Queen love, and K jam. It was in this time that Zenji flava was modernized with rapid growth in the number of artists.', 'title': 'Zenji flava'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Pierrot (stylized as PIERROT) was a Japanese visual kei rock band formed in 1994 in Nagano. After changing their name from Dizy-Lizy to Pierrot and several member changes, the final lineup was completed in 1995 with Kirito on vocals, Jun and Aiji on guitar, Kohta on bass and Takeo on drums. After roughly ten years together, Pierrot disbanded in 2006. Their final single was named "Hello", an apt title for a band who started their major career with an album called "Finale".', 'title': 'Pierrot (band)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Yellow Machinegun was a hardcore punk/heavy metal band formed in 1993 in Osaka, Japan. They produced a demo tape in December 1995. The band released their debut album called "Father\'s Golden Fish" on October 21, 1996 for Bandai Music Entertainment. This band has shared the same stage with bands such as Slayer, Motörhead, and Stormtroopers of Death. The band became dormant in June 2006. They did, however, reunite in Tokyo to play a show with the vocalist\'s new band, SuziSuzi, in April of 2017.', 'title': 'Yellow Machinegun'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': '"Stacy\'s Mom" is a pop rock song recorded by the American rock band Fountains of Wayne for their third studio album, "Welcome Interstate Managers". "Stacy\'s Mom" was released to radio on May 20, 2003. The song was released as the lead single from "Welcome Interstate Managers" on September 29, 2003 through S-Curve Records and Virgin Records. "Stacy\'s Mom" was written by bassist Adam Schlesinger and vocalist Chris Collingwood, both of whom produced the song alongside Mike Denneen. Its subject matter was inspired by a friend of Schlesinger\'s when he was young who had a crush on his grandmother. A power pop song, the group hoped to emulate the sound of the Cars with the track.', 'title': "Stacy's Mom"}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Fountains of Wayne was an American rock band that formed in New York City in 1995. The band consisted of Chris Collingwood, Adam Schlesinger, Jody Porter, and Brian Young. The band was best known for their 2003 Grammy-nominated single "Stacy\'s Mom".', 'title': 'Fountains of Wayne'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Colonel Sir Charles Rosdew Forbes-Leith, 1st Baronet (20 February 1859 – 2 November 1930), known as Charles Burn until 1923 and as Sir Charles Burn, Bt, between 1923 and 1925, was a British army officer and Conservative Party politician who was Member of Parliament for Torquay from 1910 to 1923.', 'title': 'Charles Forbes-Leith'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Master aircrew (MAcr) is the warrant-officer rank held by aircrew in the Royal Air Force. It is equivalent to warrant officer in other trades, and is effectively the highest non-commissioned aircrew rank. It has a NATO rank code of OR-9.', 'title': 'Master aircrew'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Field Marshal Sir Charles Comyn Egerton (10 November 1848 – 20 February 1921) was a senior Indian Army officer from the Egerton family.', 'title': 'Charles Egerton (Indian Army officer)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Sowar (Hindi: सवार, ਸਵਾਰ, also "siwar" meaning "the one who rides" or "rider", from Persian "sawār"), was originally a rank during the Mughal, Maratha period. Later during the British Raj it was the name in Anglo-Indian usage for a horse-soldier belonging to the cavalry troops of the native armies of British India and the feudal states. It is also used more specifically of a mounted orderly, escort or guard. It was also the rank held by ordinary cavalry troopers, equivalent to sepoy in the infantry - this rank has been inherited by the modern armies of India, Pakistan, and Bangladesh.', 'title': 'Sowar'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Jiang () is the rank held by general officers in the military of both the People's Republic of China and the Republic of China on Taiwan. The People's Liberation Army and the People's Armed Police use three levels at present while the Republic of China Armed Forces use four, with the rank equivalent to the fourth being treated as a field officer rank in the PLA (i.e. senior colonel equivalent to brigadier general ). This difference is found in other militaries as well. For example. in the British Army a brigadier is considered a field officer, while the equivalent rank in the United States Army, brigadier general, is considered a general officer.", 'title': 'Jiang (rank)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Field Marshal has been the highest rank in the British Army since 1736. A five-star rank with NATO code OF-10, it is equivalent to an Admiral of the Fleet in the Royal Navy or a Marshal of the Royal Air Force in the Royal Air Force (RAF). A Field Marshal's insignia consists of two crossed batons surrounded by yellow leaves below St Edward's Crown. Like Marshals of the RAF and Admirals of the Fleet, Field Marshals traditionally remain officers for life, though on half-pay when not in an appointment. The rank has been used sporadically throughout its history and was vacant during parts of the 18th and 19th centuries (when all former holders of the rank were deceased). After the Second World War, it became standard practice to appoint the Chief of the Imperial General Staff (later renamed Chief of the General Staff) to the rank on his last day in the post. Army officers occupying the post of Chief of the Defence Staff, the professional head of all the British Armed Forces, were usually promoted to the rank upon their appointment.", 'title': 'Field marshal (United Kingdom)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Wei (尉) is the rank held by company-grade officers in the military of both the People\'s Republic of China and the Republic of China. It currently exists in three grades, "shao wei" (少尉), "zhong wei" (中尉) ("chung wei" using Wade–Giles), and "shang wei" (上尉). An additional grade, "da wei" (大尉), formerly existed in the People\'s Liberation Army, during the period 1955-1965. However, when the use of rank and insignia was restored in 1988, this rank was not re-established. As opposed to the Western tradition of using different names for equivalent ranks in the army and navy, Chinese armed forces use the same rank names for all services, prefixed in the case of the PLA by "hai jun" (海军) (naval force) or "kong jun" (空军) (air force).', 'title': 'Wei (rank)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'General (or full general to distinguish it from the lower general officer ranks) is the highest rank currently achievable by serving officers of the British Army. The rank can also be held by Royal Marines officers in tri-service posts, for example, General Sir Gordon Messenger the new Vice-Chief of the Defence Staff. It ranks above lieutenant-general and, in the Army, is subordinate to the rank of field marshal, which is now only awarded as an honorary rank. The rank of general has a NATO-code of OF-9, and is a four-star rank. It is equivalent to a full admiral in the Royal Navy or an air chief marshal in the Royal Air Force.', 'title': 'General (United Kingdom)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Xiao (校) (Wade–Giles: Hsiao) is the rank held by field officers in the military of both the People's Republic of China and the Republic of China. The People's Liberation Army uses four grades while the Republic of China uses only three, with the rank equivalent to the fourth being treated as a general officer rank. This difference is found in other militaries as well. For example. in the British Army a brigadier is considered a field officer, while the equivalent rank in the United States Army, brigadier general, is considered a general officer. The PLA use the same rank names for all services, prefixed by Hai Jun (海军) (Naval Force) or Kong Jun (空军) (Air Force). While the ROC does the same for enlisted ranks and company-grade officers, it has distinct names for the higher naval ranks.", 'title': 'Xiao (rank)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Commissioned officers' rank insignia are identical for the army and air force. These are gold on a bright green or black shoulder board for the army and gold on a bright blue board for the air force. Officer ranks are standard, although the highest is the equivalent of Colonel General, a rank held in 1986 only by the commander in chief and the minister of defense. Navy officer rank insignia are gold stripes worn on the lower sleeve. The highest-ranking officer in Syria's navy is the equivalent of lieutenant general. Army and air force rank for warrant officers is indicated by gold stars on an olive green shield worn on the upper left arm. Lower noncommissioned ranks are indicated by upright and inverted chevrons worn on the upper left arm.", 'title': 'Military ranks of Syria'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Archview Investment Group LP is an institutional alternative investment firm based out of Stamford, Connecticut. The firm was founded in 2009 by Founding Principals Jeffrey Jacob and John Humphrey.', 'title': 'Archview Investment Group LP'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Hamilton Evans "Tony" James (born February 3, 1951) is president, chief operating officer (COO) and a director of Blackstone, a New York-based global asset management firm. He is also a known philanthropist. James has also served as chairman of Costco since August 2017.', 'title': 'Hamilton E. James'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Bain Capital is a global alternative investment firm based in Boston, Massachusetts. It specializes in private equity, venture capital and credit products. Bain Capital invests across a range of industry sectors and geographic regions. As of June 2014, the firm managed more than $75 billion of investor capital across its various investment platforms.', 'title': 'Bain Capital'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Atlantic Investment Management is a global alternative investment firm founded in 1988 by Alexander J. Roepers (“Alex”). Atlantic has 29 employees worldwide with offices in New York City and Tokyo. As of June 2014, the firm had $2.3 billion in assets under management.', 'title': 'Atlantic Investment Management'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Zachary Karabell is Head of Global Strategies at Envestnet, a publicly traded financial services firm where he works with the board and senior management on corporate strategy and with the investment committee on overall investment approaches for the firm. He is also President of River Twice Research. Previously, he was Executive Vice President, Chief Economist, and Head of Marketing at Fred Alger Management, a New York-based investment firm. He was also President of Fred Alger & Company, a broker-dealer; Portfolio Manager of the China-U.S. Growth Fund (CHUSX); and Executive Vice President of Alger’s Spectra Funds, a no-load family of mutual funds that managed the Spectra Green Fund. He founded and ran the River Twice Fund from 2011-2013, a $25 million alternative investment fund which used sustainable business as its primary investment theme.', 'title': 'Zachary Karabell'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "James Man (1755–1823) was the founder of Man Group, the United Kingdom's largest alternative investment management business.", 'title': 'James Man'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Crescent Capital Group is an alternative investment firm focused on below investment grade markets with primary strategies that include funds that invest in senior bank loans, high-yield debt, mezzanine debt, special situations, and distressed securities. The firm has approximately $25 billion of assets under management and has made investments in over 190 companies since its inception as well as expanded into the European market with operations based in London.', 'title': 'Crescent Capital Group'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Kenneth C. Griffin (born October 15, 1968) is an American investor, hedge fund manager, and philanthropist. He is the founder and chief executive of the global investment firm Citadel, founded in 1990. s of March 2015 , Citadel is one of the world\'s largest alternative investment management firms with an estimated $25 billion in investment capital. Citadel\'s group of hedge funds rank among the largest and most successful hedge funds in the world. " Forbes" identified Griffin as one of 2012\'s highest earning hedge fund managers as well as one of the Forbes 400.', 'title': 'Kenneth C. Griffin'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Cowen Inc. is a diversified financial services firm that provides alternative investment management, investment banking, research, and sales and trading services through its two business segments: Cowen Investment Management (formerly Ramius LLC), a global alternative investment management business, and Cowen and Company, LLC, a broker-dealer business. Founded in 1918 by Harry Cowen and Arthur Cowen, Jr., the Firm is headquartered in New York City and has offices located worldwide.', 'title': 'Cowen Group'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The Blackstone Group L.P. is an American multinational private equity, alternative asset management and financial services firm based in New York City. As the largest alternative investment firm in the world, Blackstone specializes in private equity, credit and hedge fund investment strategies.', 'title': 'The Blackstone Group'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Onizuka Prop Wash Award recognizes the student at the United States Air Force Test Pilot School (USAF TPS) who contributed most to class spirit and morale. The honoree from each class is selected by his or her fellow students rather than by school faculty. The award is named in memory of TPS graduate Ellison Onizuka who perished in the explosion of the Space Shuttle "Challenger" in 1986.', 'title': 'Onizuka Prop Wash Award'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The NASA Space Flight Medal is a decoration of the National Aeronautics and Space Administration. According to its statutes, it is awarded "for significant achievement or service during individual participation as a civilian or military astronaut, pilot, mission specialist, payload specialist, or other space flight participant in a space flight mission." In practice, the medal is bestowed upon any astronaut (US or foreign) who flies aboard a United States space mission, and typically every subsequent flight is honored with an additional award.', 'title': 'NASA Space Flight Medal'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Ellison Shoji Onizuka (June 24, 1946\xa0– January 28, 1986 ) was an American astronaut from Kealakekua, Hawaii, who successfully flew into space with the Space Shuttle "Discovery" on STS-51-C. He died in the destruction of the Space Shuttle "Challenger", on which he was serving as Mission Specialist for mission STS-51-L. He was the first Asian American and the first person of Japanese ancestry to reach space.', 'title': 'Ellison Onizuka'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Double Star is a joint satellite based space mission by the China National Space Administration (CNSA) and the European Space Agency (ESA). It is the first space mission launched by China to investigate Earth's magnetosphere. It consists of two satellites: an Equatorial satellite (TC-1) and Polar satellite (TC-2). Double Star follows in the footsteps of ESA's Cluster mission by studying the effects of the Sun on the Earth's environment. After a nominal mission of one year (from the launch of TC-2 in July 2004), the Double Star mission was extended twice by both agencies till the end of September 2007.", 'title': 'Double Star (satellite)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'A mission patch is a cloth reproduction of a spaceflight mission emblem worn by astronauts and other personnel affiliated with that mission. It is usually executed as an embroidered patch. The term space patch is mostly applied to an emblem designed for a manned space mission. Traditionally, the patch is worn on the space suit that astronauts and cosmonauts wear when launched into space. Mission patches have been adopted by the crew and personnel of many other space ventures, public and private.', 'title': 'Mission patch'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Jay Barbree (born November 26, 1933) is a correspondent for NBC News, focusing on space travel. Barbree is the only journalist to have covered every manned space mission in the United States, beginning with the first American in space, Alan Shepard aboard "Freedom 7" in 1961, continuing through to the last mission of the Space Shuttle, "Atlantis\'s" STS-135 mission in July 2011. Barbree has been present for all 135 space shuttle launches, and every manned launch for the Mercury, Gemini, and Apollo eras. In total, Barbree has been witness to 166 manned space launches.', 'title': 'Jay Barbree'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Euclid (named after the ancient Greek mathematician Euclid of Alexandria, the "Father of Geometry"), is a space mission currently under development by the European Space Agency (ESA). The objective of Euclid is to better understand dark energy and dark matter by accurately measuring the acceleration of the universe. To achieve this, the spacecraft will measure the redshift of galaxies at varying distances from Earth and investigate the relationship between distance and redshift. Dark energy is generally accepted as contributing to the increased acceleration of the expanding universe, so understanding this relationship will help to refine how physicists and astrophysicists understand it. Euclid\'s mission advances and complements ESA\'s Planck mission, and other contemporary space missions.', 'title': 'Euclid (spacecraft)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'David Nathaniel Spergel (born March 25, 1961), is an American theoretical astrophysicist and Princeton University professor known for his work on the WMAP (Wilkinson Microwave Anisotropy Probe) mission. Spergel is a MacArthur Fellow. He is a member of the NASA Advisory Council and is chair of the Space Studies Board. He was once the W.M. Keck distinguished visiting professor at the Institute for Advanced Study in Princeton, New Jersey. He was part of the team that originated the WMAP mission and designed the spacecraft, and has worked on deciphering the data that it beams back from space. Spergel is playing a leading role in developing the WFIRST(Wide Field Infrared Space Telescope), a multibillion-dollar space mission planned for launch in the mid-2020s. Spergel is the Charles A Young Professor of Astronomy and a member of the National Academy of Sciences. Spergel is the Founding Director of the Center for Computational Astrophysics. He', 'title': 'David Spergel'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Cluster II is a space mission of the European Space Agency, with NASA participation, to study the Earth's magnetosphere over the course of nearly two solar cycles. The mission is composed of four identical spacecraft flying in a tetrahedral formation. As a replacement for the original Cluster spacecraft which were lost in a launch failure in 1996, the four Cluster II spacecraft were successfully launched in pairs in July and August 2000 onboard two Soyuz-Fregat rockets from Baikonur, Kazakhstan. In February 2011, Cluster II celebrated 10 years of successful scientific operations in space. The mission has been extended until December 2018. China National Space Administration/ESA Double Star mission operated alongside Cluster II from 2004 to 2007.", 'title': 'Cluster II (spacecraft)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Don Quijote is a past space probe concept that has been studied by the European Space Agency, and which would investigate the effects of crashing a spacecraft into an asteroid. The mission was intended to test whether a spacecraft could successfully deflect an asteroid on a collision course with Earth. The orbiter was designed to last for seven years. The mission did not proceed beyond initial studies, currently ESA is working on Asteroid Impact & Deflection Assessment mission as a part of its NEO space mission studies.', 'title': 'Don Quijote (spacecraft)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Chesley Burnett "Sully" Sullenberger III (born 1951) is an American retired airline captain celebrated for the January 15, 2009 water landing of US Airways Flight 1549 in the Hudson River off Manhattan after the plane was disabled by striking a flock of Canada geese immediately after takeoff; all 155 people aboard survived. Sullenberger is an international speaker on airline safety and has helped develop new protocols for airline safety. He served as the co-chairman, along with First Officer Jeffrey Skiles, of the EAA\'s Young Eagles youth introduction-to-aviation program from 2009 to 2013. He retired from US Airways after 30 years as a commercial pilot on March 3, 2010. In May of the following year, Sullenberger was hired by CBS News as an Aviation and Safety Expert.', 'title': 'Chesley Sullenberger'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"Nothing Really Matters" is a song recorded by American singer Madonna for her seventh studio album, "Ray of Light" (1998). It was written by Madonna and Patrick Leonard, and was produced by the singer with William Orbit and Marius De Vries. The song was released as the fifth and final single from the album on March 2, 1999 by Maverick Records and Warner Bros. Records. An EDM track on which Madonna experiments with different musical genres, "Nothing Really Matters" includes ambient music and electronic noise frequencies that were added by De Vries. Lyrically, the recording delves on the singer\'s first daughter Lourdes Leon, having also themes of selfishness, affection, and motherhood.', 'title': 'Nothing Really Matters'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Peter Rauhofer (29 April 1965 – 7 May 2013) was a disc jockey (DJ), remixer and producer who formerly went under the moniker Club 69 as well as Size Queen. A native of Vienna, Austria, he was famous for a variety of his remixes including Cher\'s "Believe" and a number of Madonna\'s songs including "Nothing Really Matters", "American Life", "Nothing Fails", "Nobody Knows Me", "Get Together", "Impressive Instant" and "4 Minutes", as well as her collaboration with Britney Spears, "Me Against the Music" and various collaborations with Janet Jackson ("Throb" and "Just A Little While" to name a few). He has also provided remixes for Whitney Houston, Jessica Simpson, Britney Spears, Christina Aguilera, Yoko Ono, Pink, Tori Amos, Pet Shop Boys, Depeche Mode, Yazoo, Frankie Goes To Hollywood, Book Of Love, Soft Cell, Duran Duran and Mariah Carey, among others. He was also behind the tribal house record label Star 69 and was a frequent producer of the label\'s releases.', 'title': 'Peter Rauhofer'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Life Could Be Verse: Reflections on Love, Loss, and What Really Matters', 'title': 'Life Could Be Verse: Reflections on Love, Loss, and What Really Matters'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'G-A-Y is a gay nightclub in London. It operated from the London Astoria music venue for 15 years until July 2008. The Boston Globe described it as "London\'s largest gay-themed club night", "NME" reported that it "attracts 6,000 clubbers each week", and "The Independent" described it as "the one London gig that really matters" for "today\'s pop stars". On Friday 3 October 2008, it moved to famous gay venue Heaven.', 'title': 'G-A-Y'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Highest Duty: My Search for What Really Matters is a memoir written by Chesley Sullenberger and Jeffrey Zaslow (1958–2012) describing the events of US Airways Flight 1549. The "New York Times" bestselling autobiography of Capt. Chesley “Sully” Sullenberger—the pilot who landed a crippled airplane in New York\'s Hudson River, saving the lives of the 155 passengers—discusses leadership, responsibility, and service, along with his life story.', 'title': 'Highest Duty: My Search for What Really Matters'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Nothing Really Matters" is a song by Dutch recording artist Mr Probz. It was released on 29 September 2014 as a digital download. The song was written by Dennis Princewell Stehr, Aliaune Thiam, Giorgio Tuinfort and Jake Gosling. It peaked to number 1 on the Dutch Singles Chart and in Portugal. The song has also charted in Belgium and Sweden.', 'title': 'Nothing Really Matters (Mr Probz song)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Love Is is the title of the second album released by American country music artist Kevin Sharp. The two singles released from the album, "Love Is All That Really Matters" and "If She Only Knew", both failed to reach the top 40 in the charts while the album itself reached #36 on the "Billboard" Top Country Albums chart. "Her Heart Is Only Human" was originally recorded by Ty Herndon on his 1996 album "Living in a Moment".', 'title': 'Love Is (Kevin Sharp album)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Medford Cable News, (MCN) is the City of Medford, MA\'s only non-profit broadcast news station. Owned and operated by Medford Community Cablevision, Inc. MCN began in 2010 as a short news topic program that aired on Comcast channel 3. After Medford Community Cablevision was internationally recognized by the Alliance for Community Media for "Overall Excellence in Public Television," the news station expanded to live broadcasts and an online publication. MCN reports on local, government, business, and entertainment news. The company plans to also feature live weather and sports reports by July 2011.', 'title': 'Medford Cable News'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'All That Really Matters (Polish: Wszystko, co najważniejsze ) is a 1992 Polish drama film directed by Robert Gliński. The film was selected as the Polish entry for the Best Foreign Language Film at the 65th Academy Awards, but was not accepted as a nominee.', 'title': 'All That Really Matters'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Alisa Peta Camplin OAM (born 10 November 1974) is an Australian aerial skier who won gold at the 2002 Winter Olympics, the second ever winter Olympic gold medal for Australia. At the 2006 Winter Olympics, Camplin finished third to receive a bronze medal. She is the first Australian skier to win medals at consecutive Winter Olympics, making her one of Australia's best skiers.", 'title': 'Alisa Camplin'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Edgar Grospiron (born March 17, 1969) is a French freestyle skier and Olympic champion. He won a gold medal at the 1992 Winter Olympics in Albertville. He received a bronze medal at the 1994 Winter Olympics in Lillehammer. At the 2012 Winter Youth Olympics he was "Chef de mission" for the French Team. He was in charge of the Annecy bid for the 2018 Winter Olympics, which did not win.', 'title': 'Edgar Grospiron'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Sri Lanka is scheduled to compete in the 2017 Asian Winter Games in Sapporo and Obihiro, Japan from February 19 to 26. This marks the country's official debut at the Asian Winter Games and a global Winter sporting event. The country is scheduled to compete with five athletes in one sport (three disciplines). The team will also consist of two officials and a chef de mission. The chef de mission of the team is Gihan Dalpathdo, the gecretary general of Winter Sport Association of Sri Lanka.", 'title': 'Sri Lanka at the 2017 Asian Winter Games'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Jana Gantnerová-Šoltýsová (born 30 September 1959 in Kežmarok) is a Slovak former alpine skier who competed for Czechoslovakia in the 1976 Winter Olympics, 1980 Winter Olympics, and 1984 Winter Olympics. In December 1980 she won an Alpine Skiing World Cup downhill in Altenmarkt, becoming the first east European skier to win a World Cup race. Her best performance at the Olympics was a fifth place in the downhill in 1984. Since retiring from competition she has served as president of the Slovak Skiing Association, as a member of the Slovak Olympic Committee Executive Board, as a member of the International Ski Federation Alpine Commission, and as Deputy Chef de Mission for the Slovak team at the 2010 Winter Olympics. She is the mother of alpine skier Jana Gantnerová.', 'title': 'Jana Gantnerová-Šoltýsová'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Canada competed at the 2016 Summer Olympics in Rio de Janeiro, Brazil, from August 5 to August 21, 2016. Since the nation's debut in 1900, Canadian athletes had appeared in every edition of the Summer Olympic Games, with the exception of the 1980 Summer Olympics in Moscow because of the United States-led boycott. The chef de mission was Curt Harnett, appointed in April 2016 after Jean-Luc Brassard, the original chef de mission, resigned his position.", 'title': 'Canada at the 2016 Summer Olympics'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Geoffrey "Geoff" John Henke, AO is a former Australian ice hockey player and Australian Olympic Committee official. He was the chef de mission of the Australian Winter Olympic delegations from 1976 until 1994, and is credited with ending the neglect of winter sports in Australia.', 'title': 'Geoff Henke'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Australia competed at the 2012 Winter Youth Olympics in Innsbruck. The chef de mission of the team will be former Olympic champion Alisa Camplin, the first time a woman is the chef de mission of any Australian Olympic team. The Australian team will consist of 13 athletes in 8 sports.', 'title': 'Australia at the 2012 Winter Youth Olympics'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "As a player, he had success from 1982 to 1996. He went on to coach the women's team that won gold in Curling at the 2002 Winter Olympics and, partly due to this, was appointed as an MBE in 2004. He later served as Britain's Olympic performance manager at the 2010 Winter Olympics. After this he became Chef de Mission for Team GB for the 2014 Winter Olympics. He is brother to David Hay and son of curler Chuck Hay.", 'title': 'Mike Hay'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Herman Ronald "Herm" Frazier (born October 29, 1954) is a retired American sprinter. He won gold medals in the 4×400 m relay at the 1976 Olympics and 1975 and 1979 Pan American Games. Individually he earned a bronze medal in the 400 m event at the 1976 Olympics. He served as chef de mission of the 2004 U.S. Olympic team and as the Athletic Director at the University of Alabama at Birmingham and the University of Hawaii.', 'title': 'Herman Frazier'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Canada, which is represented by the Canadian Olympic Committee (COC), has competed at the 2011 Pan American Games in Guadalajara, Mexico from October 14 to 30, 2011. The Canadian team was made up of 492 athletes (256 men and 236 women), the most ever for a non-home Games. On the team all ten provinces and the Northwest Territories are represented. Some sports such as wrestling have sent their strongest team, however sports which offer the most medals (swimming and athletics) have sent for the most part a developmental team. Table Tennis player Anqi Luo (15 years old) was Canada's youngest athlete at the Games while Equestrian athlete Ian Millar (64 years old) was Canada's eldest athlete competing in Guadalajara. Canada has competed in 35 out of the 36 sports on the program (the exception being basque pelota). On October 4, 2011 women's football star Christine Sinclair was selected to carry the flag during the opening ceremony. The chef de mission was Jacques Cardyn and the assistant chef de mission was Curt Harnett.", 'title': 'Canada at the 2011 Pan American Games'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Nicholas Mark "Nick" Reding (born 31 August 1962 in Chiswick, London) is an English actor. During a career of more than two decades, he is probably best known for playing PC Pete Ramsey in "The Bill" and DI Michael Conner in the BBC crime thriller series "Silent Witness". His many TV and film appearances include "The Monocled Mutineer", "Bodyguards", "Oscar", "Peak Practice", "Frank Stubbs Promotes", "Minder", "Tales from the Crypt", "Bugs", "Sword of Honour", "A Touch of Frost", "Paradise Postponed", "Murder in Mind", "Boon", "The Ruth Rendell Mysteries", "Captive", "Mister Johnson", "The House of Eliott", "Police 2020", "Sunburn", "Croupier", "Judge John Deed", "The Constant Gardener", "Blood Diamond" and "Soul Boy". On stage he played Joseph Porter Pitt in Tony Kushner\'s "Angels in America" at the Royal National Theatre, as well as leading roles at the Royal Court. He also appeared in "Lovejoy".', 'title': 'Nick Reding (actor)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Cathy Moriarty (born November 29, 1960) is an American actress whose career spans over 30 years. She was nominated for an Academy Award for Best Supporting Actress for "Raging Bull" (1980). She also starred in films, including "Neighbors", "White of the Eye", "Soapdish", "Casper", "Analyze That", and "The Bounty Hunter". She starred in television roles, such as "Tales from the Crypt" (in which she won a CableACE Award for Best Actress in a Dramatic Series), "Law & Order", "" and "".', 'title': 'Cathy Moriarty'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Aaron Paul Sturtevant (born August 27, 1979), known as Aaron Paul, is an American actor. He is best known for portraying Jesse Pinkman in the AMC series "Breaking Bad", for which he won several awards, including the Critics\' Choice Television Award for Best Supporting Actor in a Drama Series (2014), the Satellite Award for Best Supporting Actor – Series, Miniseries, or Television Film (2013), and the Primetime Emmy Award for Outstanding Supporting Actor in a Drama Series. This made him the only actor to win the latter category three times (2010, 2012, 2014), since its separation into drama and comedy. He has also won the Saturn Award for Best Supporting Actor on Television three times (2009, 2011, 2013), more than any other actor in that category.', 'title': 'Aaron Paul'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Stephen Semel (sometimes credited as Steve Semel or Steven Semel) is an American Primetime Emmy Award-winning film and television editor, film producer, production manager, and actor. He has worked as an editor for mainstream movies, such as "Airheads", "The Count of Monte Cristo", "Fandango", "Kuffs", "License to Drive", "Miracle Mile", "My Giant", "One Eight Seven", "Only The Strong", "Three to Tango", "The Truth About Cats & Dogs", "The Way of the Gun", and "You So Crazy". Semel has also edited episodes of several television series, including episodes of "Century City", "Dragnet", "Kyle XY", "House", "Melrose Place", and "Tales from the Crypt".', 'title': 'Stephen Semel'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'John Kassir (born October 24, 1957) is an American actor, voice actor and comedian. He is known as the voice of the Crypt Keeper in HBO\'s "Tales from the Crypt" franchise. Kassir is also known for his role as Ralph in the Off-Broadway show "Reefer Madness", as well as its film adaptation, as well as his voice over work as Buster Bunny (taking over for Charlie Adler late in the final season of "Tiny Toon Adventures"), Ray "Raymundo" Rocket on "Rocket Power", the mischievous raccoon Meeko in "Pocahontas" and its direct-to-video sequel, Jibolba in the "Tak and the Power of Juju" video game series, and the current voices of Pete Puma in "The Looney Tunes Show", and Deadpool in "" and the "" series. He has also recently done the voice of Rizzo for the newest Spyro game, , and voiced Ghost Roaster in "", as well as Short Cut in "" and Pit Boss in "". He is also known for his various roles in season 1 of "The Amanda Show". He voiced the Ice King in the Adventure Time (pilot) but was replaced by Tom Kenny for the series. He also provided additional voice over work for "Sonic the Hedgehog", "Eek! The Cat", "The Brothers Flub", "Dead Rising", "Casper\'s Scare School", "Spider-Man 3", "", "Diablo III", "Monsters University", "The Prophet", "" and "The Secret Life of Pets".', 'title': 'John Kassir'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Britt Leach (born July 18, 1938; Gadsden, Alabama) is an American character actor. He is best known for his roles in the films "Fuzz" (1972), "Interval" (1973), "The California Kid" (1974), "Jackson County Jail" (1976), "Goin\' South" (1978), "Loose Shoes" (1978), "Hardly Working" (1980), "" (1980), "Night Warning" (1982), "The Last Starfighter" (1984), "Silent Night, Deadly Night" (1984), "Weird Science" (1985), "Baby Boom" (1987) and "The Great Outdoors" (1988). Leach has also made guest appearances in television shows such as "The Brady Bunch", "The Partridge Family", "Bonanza", "Tales from the Crypt" and many others.', 'title': 'Britt Leach'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Tales from the Crypt is a 1972 British horror film, directed by Freddie Francis. It is an anthology film consisting of five separate segments, based on stories from EC Comics. Only two of the stories, however, are actually from EC\'s "Tales from the Crypt". The reason for this, according to "Creepy" founding editor Russ Jones, is that producer Milton Subotsky did not own a run of the original EC comic book but instead adapted the movie from the two paperback reprints given to him by Jones. The movie was one of many Amicus horror anthologies made during the 1970s and features an all star cast, including Joan Collins, Peter Cushing, Richard Greene, and Roy Dotrice, with Ralph Richardson as the Crypt Keeper.', 'title': 'Tales from the Crypt (film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Rizwan Ahmed (Urdu: \u200e ; born 1 December 1982), also known as Riz MC, is a British-Pakistani actor, rapper and activist. As an actor, he won an Emmy Award, out of two Emmy nominations, and was also nominated for a Golden Globe, Screen Actors Guild Award, and three British Independent Film Awards. He was initially known for his work in independent films such as "The Road to Guantanamo" (2006), "Shifty" (2008), "Four Lions" (2010), "Trishna" (2011), and "Ill Manors" (2012), before his breakout role in "Nightcrawler" (2014). In 2016, he starred in "Una", "Jason Bourne", and as Bodhi Rook in the first "Star Wars" "Anthology" film, "Rogue One". That year, he also starred in the HBO miniseries "The Night Of" as Nasir Khan; the show and his performance were critically lauded. At the 2017 Emmy Awards, he received two nominations, for his performance in "The Night Of" and his guest spot in "Girls"; he won the award for Outstanding Lead Actor in a Limited Series or Movie for "The Night Of", becoming the first Asian and first Muslim to win in the category, the first South Asian male to win an acting Emmy, and the first Muslim and first South Asian to win a lead acting Emmy.', 'title': 'Riz Ahmed'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Peter Wilton Cushing, OBE (26 May 191311 August 1994) was an English actor and a BAFTA TV Award Best Actor winner in 1956. He is mainly known for his prolific appearances in Hammer Films, in which he played strong character roles like the sinister scientist Baron Frankenstein, Sherlock Holmes and the vampire hunter Dr. Van Helsing, among many other roles. He appeared frequently opposite Christopher Lee and, occasionally, Vincent Price.', 'title': 'Peter Cushing'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Robert Sacchi (born March 3, 1941 in Bronx, New York) is an American character actor who, since the 1970s, has been known for his close resemblance to Humphrey Bogart. Sacchi has appeared in many films and TV shows playing either Bogart or a character who happens to look and sound like him. In a notable episode of "Tales from the Crypt" called "You, Murderer", in 1995 ( season 6 épisode 15 ), Sacchi only provided the voice of a character who looks like Bogart; computer manipulated stock footage of Bogart himself provided the visuals.', 'title': 'Robert Sacchi'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Bandi Sailu (1928 – 15 July 2000) or Sayilu Saayilu was a Marxist revolutionary born in a Dalit family in Mandapelli village, Duggondi mandal, Narsampeta Thalukh in the Warangal district of Andhra Pradesh, India.', 'title': 'Bandi Sailu'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'You Fell Victim (Russian: "Вы жертвою пали"; "Vy zhertvoiu pali"), or You Fell Victim to a Fateful Struggle, is a Russian Marxist and revolutionary funeral march. It acted as the funeral dirge of the Russian revolutionary movement, among them the Bolsheviks.', 'title': 'You Fell Victim to a Fateful Struggle'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Sergey Yustinovich Bagotsky (Russian: Серге́й Юстинович Багоцкий ; 15 February 1879 - 15 March 1953) was a Russian Marxist revolutionary and Soviet medicine and Red Cross diplomat, Soviet head of the Red Cross representative mission to Geneva from 1918 to 1936.', 'title': 'Sergey Yustinovich Bagotsky'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Apollinariya Yakubova (died 1913 or 1917) was a Russian Marxist revolutionary and, with Vladimir Lenin, one of the founders of the League of Struggle for the Emancipation of the Working Class.', 'title': 'Apollinariya Yakubova'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Matvey Ivanovich Skobelev (Russian: Матве́й Ива́нович Ско́белев ; November 9, 1885, Baku – July 29, 1938, Moscow) was a Russian Marxist revolutionary and politician.', 'title': 'Matvey Skobelev'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Aleksandra Lvovna Sokolovskaya (Russian: Александра Львовна Соколовская ; 1872 – c. 1938) was a Russian Marxist revolutionary and Leon Trotsky's first wife. She perished in the Great Purges no earlier than 1938.", 'title': 'Aleksandra Sokolovskaya'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Vpered ("Forward" or "Hasten") (1909 - 1912) was an organization emanating from within the Russian Social Democratic Labour Party (Russian Social Democracy or RSDLP). The faction was gathered by Alexander Bogdanov (1873 - 1928) in December 1909. The group included: Alexander Bogdanov, Maxim Gorky, Anatoly Lunacharsky, Mikhail Pokrovsky, Grigory Aleksinsky, Stanislav Volski, and Martyn Liadov. Although Vpered emerged from the Bolshevik wing of Russian Social Democracy, the group was critical of Lenin.', 'title': 'Vpered'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Anatoly Vasilyevich Lunacharsky (Russian: Анато́лий Васи́льевич Лунача́рский , , 23 November\xa0[O.S. 11 November]\xa01875 – 26 December 1933) was a Russian Marxist revolutionary and the first Soviet People's Commissar of Education responsible for culture and education. He was active as an art critic and journalist throughout his career.", 'title': 'Anatoly Lunacharsky'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Martemyan Nikitich Ryutin (Russian: Мартемья́н Ники́тич Рю́тин ) (1890–1937) was a Russian Marxist revolutionary, and a political functionary of the Russian Communist Party. Ryutin is best remembered as the leader of a pro-peasant political faction organized against Soviet leader Joseph Stalin in the early 1930s and as the primary author of a 200-page oppositional platform. Ryutin was arrested by the Soviet secret police, along with his co-thinkers, in what has come to be known as the Ryutin Affair. He was executed in January 1937 as part of the Yezhovshchina (Great Purge) conducted against political oppositionists and suspected economic "wreckers" and spies.', 'title': 'Martemyan Ryutin'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Vladimir Alexandrovich Bazarov ( Влади́мир Алекса́ндрович База́ров; 1874–1939) was a Russian Marxist revolutionary, journalist, philosopher, and economist, born Vladimir Alexandrovich Rudnev. Bazarov is best remembered as a pioneer in the development of economic planning in the Soviet Union.', 'title': 'Vladimir Bazarov'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Francis Tresham is a United Kingdom-based board game designer who has been producing board games since the early 1970s. Tresham founded and ran games company Hartland Trefoil (founded 1971), a company well known for its "Civilization" board game, until its sale to MicroProse in 1997. His "1829" game was the first of the "18xx" board game series and some of his board games have inspired Sid Meier computer games such as "Railroad Tycoon".', 'title': 'Francis Tresham (game designer)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'This page explains commonly used terms in board games in alphabetical order. For a list of board games, see List of board games. For terms specific to chess, see Glossary of chess. For terms related to chess problems, see Glossary of chess problems.', 'title': 'Glossary of board games'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Word board games are those games played on a board as players of the game attempt to construct words that use a scoring system. The player with the highest score wins the game. Many if not most board games are also available as software programs and online. Online word board games can be organized so that the player is playing against other people or the game can be played against an automated program acting as an artificial intelligence. Players of some word board games organize themselves into associations, clubs, and tournaments.', 'title': 'List of word board games'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Brian "Chainsaw" Campbell is a Greater Seattle area game developer, author and editor who is credited for working in the role-playing game industry as far back as 1993. Brian\'s notable work includes "", "", "", Ratkin, and other World of Darkness products for White Wolf, the d20 versions of "Call of Cthulhu" and "Star Wars" for Wizards of the Coast, indie games such as "Spaceship Zero" for Green Ronin and "Fading Suns" for Holistic Design, Inc., and a foray into board games that included "Betrayal at House on the Hill" from Avalon Hill.', 'title': 'Brian Campbell (game designer)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Bear games is a category of board games of which many have historical roots in the Roman Empire. They were played in parts of the Empire as far away as Turkey and France and are still played today, especially in Italy. All of the games are two-player abstract strategy board games. Normally, the game is played with three hunters and one bear on a patterned board. It bears similarity to the hunt games such as the Fox games, Rimau-rimau, and Bagha-Chall, however, there are no captures involved. The three hunters are trying to hem in the bear, and block its movements.', 'title': 'Bear games'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Villa Paletti is a board game of physical skill designed by Bill Payne and published in 2001 by Zoch Verlag. Players compete to build the villa highest using columns from lower floors without collapsing the structure.', 'title': 'Villa Paletti'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'David Parlett (born 1939) is a games scholar, historian, and translator from South London, who has studied both card games and board games. His published works include many popular books on games and the more academic volumes "The Oxford Guide to Card Games" and "The Oxford History of Board Games", both now out of print. Parlett also invented a number of board games, the most successful of which is Hare and Tortoise (1974). The German edition was awarded Spiel des Jahres (Game of the Year) in 1979.', 'title': 'David Parlett'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Robert Charles Bell (1917–2002) was the author of several books on board games, most importantly "Board and Table Games 1 & 2" (reprinted as "Board and Table Games from Many Civilizations"). This work won the Premier Award of the Doctors\' Hobbies Exhibition, London. He was instrumental in popularizing traditional games, and is acknowledged as one of 11 "principal sources" in David Parlett\'s "The Oxford History of Board Games".', 'title': 'Robert Charles Bell'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Days of Wonder is a board game publisher owned by Asmodee Group since 2014. Founded in 2002, Days of Wonder distributes its games to 25 countries. It specialises in German-style board games and have branched out to include some online games. Days of Wonder has published games in English, French, German, Spanish, Italian, Dutch, Hungarian, Finnish, Polish, Danish, Czech, Swedish, Norwegian, Korean, Japanese, Portuguese, Russian, Greek. Days of Wonder was co-founded by Eric Hautemont, Pierre Gaubil, Mark Kaufman & Yann Corno. Under the guidance of the company's Creative Director, Cyrille Daujean, the company quickly made a name for itself as a publisher of board games with top notch components and gorgeous designs.", 'title': 'Days of Wonder'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Betrayal at House on the Hill is a board game published by Avalon Hill in 2004, designed by Bruce Glassco and developed by Rob Daviau, Bill McQuillan, Mike Selinker, and Teeuwynn Woodruff. Players all begin as allies exploring a haunted house filled with dangers, traps, items and omens. As players explore the mansion, new room tiles are chosen at random; accordingly, the game board is different each session. Eventually the "haunt" begins, with the nature and plot of this session\'s ghost story revealed; one player usually "betrays" the others and takes the side of the ghosts, monsters, or other enemies, while the remaining players collaborate to defeat them.', 'title': 'Betrayal at House on the Hill'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'On 6 February 2017, the Sapphire Jubilee of Queen Elizabeth II, marking sixty-five years of her reign, occurred. The longest-reigning monarch in British history, Queen Elizabeth II was the first British monarch to have a sapphire jubilee. This Jubilee featured blue stamps from the Royal Mail, commemorative coins from the Royal Mint, and a reissue of an official 2014 portrait of Queen Elizabeth II by David Bailey. In this official portrait the Queen wears sapphire jewellery which she received as a wedding present from her father. The Jubilee also involved a gun salute at the Tower of London, a gun salute in Green Park, gun salutes in several other places around the United Kingdom, and the ringing of the bells in Westminster Abbey. Theresa May, the Prime Minister of the United Kingdom, congratulated Queen Elizabeth II in regard to the occasion, saying in part, "I know the nation will join with me today in celebrating and giving thanks for the lifetime of service Her Majesty the Queen has given to our country and to the Commonwealth."', 'title': 'Sapphire Jubilee of Queen Elizabeth II'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Queen Elizabeth II Golden Jubilee Medal (French: "Médaille du jubilé de la Reine Elizabeth II" ) or the Queen\'s Golden Jubilee Medal was a commemorative medal created in 2002 to mark the fiftieth anniversary of Elizabeth II\'s accession. The Queen Elizabeth II Golden Jubilee Medal was awarded in Canada to nominees who contributed to public life. The Queen\'s Golden Jubilee Medal was awarded to active personnel in the British Armed Forces and Emergency Personnel who had completed 5 years of qualifying service.', 'title': 'Queen Elizabeth II Golden Jubilee Medal'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Queen Elizabeth Hospital or Queen Elizabeth's Hospital may refer to one of several institutions named after Queen Elizabeth I, Queen Elizabeth II or Queen Elizabeth the Queen Mother:", 'title': 'Queen Elizabeth Hospital'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Sarah Ferguson wore a dress made from ivory duchesse satin and featuring heavy beadingfor her wedding to Prince Andrew, Duke of York on 23 July 1986 at Westminster Abbey. Designed by Lindka Cierach, the beadwork incorporated various symbols including hearts representing romance, anchors and waves representing Prince Andrew\'s sailing background and bumblebees and thistles, which were taken from Sarah Ferguson\'s family crest. Copies of the dress, including the motifs specific to the royal family, went on sale in stores just hours after the end of the wedding.Influenced by the wedding dress of Lady Diana Spencer, a notable feature of Sarah Ferguson\'s 17 foot long train was the intertwined initials A and S sewn in silver beads. The head-dress and bouquet, fabric rosettes or artificial silk flowers were used to adorn the gown itself. Ferguson was pleased with the dress, describing it in her 1997 memoir, "My Story", as "an exquisite creation I\'d lost twenty-six pounds to fit into. Lindka was a genius; I knew she could make the most flattering gown ever, and she had. It was amazingly boned, like a corset. "Hair stylist Denise McAdam and make-up artist Teresa Fairminer attended to the bride, while florist Jane Packer designed the bouquet. The ivory silk wedding dress became the season\'s most sought-after style.', 'title': 'Wedding dress of Sarah Ferguson'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Diamond Jubilee of Queen Elizabeth II was a multinational celebration throughout 2012, that marked the 60th anniversary of the accession of Queen Elizabeth II on 6 February 1952. Queen Elizabeth is queen regnant of 16 sovereign states, known as Commonwealth realms, including the United Kingdom. The only other time in British history that a monarch celebrated a Diamond Jubilee was in 1897, when Queen Victoria celebrated hers.', 'title': 'Diamond Jubilee of Queen Elizabeth II'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Lindka Rosalind Wanda Cierach is a British couturier and fashion designer. Notable clients include members of British and European Royal Families, Helen Mirren, Lady Victoria Hervey and Cherie Blair among others.', 'title': 'Lindka Cierach'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The George VI and Queen Elizabeth Memorial, situated between The Mall and Carlton Gardens in central London, is a memorial to King George VI and his consort, Queen Elizabeth The Queen Mother. Completed in its present form in 2009, the memorial incorporates an earlier, Grade II-listed statue of George VI by William McMillan, unveiled by his daughter Queen Elizabeth II in 1955. The reconfigured memorial, which includes a statue of the Queen Mother by Philip Jackson, relief sculpture by Paul Day and an architectural setting by Donald Buttress and Donald Insall, was unveiled by Elizabeth II in 2009.', 'title': 'George VI and Queen Elizabeth Memorial'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Queen Elizabeth cake is a dessert cake prepared with typical cake ingredients and a shredded coconut icing. It is sometimes served with tea. Queen Elizabeth cake is named after Elizabeth II. It may have originated in 1953 for the coronation of Elizabeth II, and another account holds that it was invented for the 1937 coronation of King George VI and the Queen Mother Queen Elizabeth.', 'title': 'Queen Elizabeth cake'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Golden Jubilee of Queen Elizabeth II was the international celebration held in 2002 marking the 50th anniversary of the accession of Elizabeth II to the thrones of seven countries, upon the death of her father, King George VI, on 6 February 1952, and was intended by the Queen to be both a commemoration of her 50 years as monarch and an opportunity for her to officially and personally thank her people for their loyalty. Despite the deaths of her sister, Princess Margaret, and mother, Queen Elizabeth The Queen Mother, in February and March 2002 respectively, and predictions in the media that the anniversary would be a non-event, the jubilee was marked with large-scale and popular events throughout London in June of the same year, bookended by events throughout the Commonwealth realms. Elizabeth attended all of the official celebrations as scheduled, along with her husband, the Duke of Edinburgh; over twelve months, the royal couple journeyed more than 40000 mi to the Caribbean, Australia, New Zealand, then around the United Kingdom, and wrapped up the jubilee year in Canada. Numerous landmarks, parks, buildings, and the like, were also named in honour of the golden jubilee and commemorative medals, stamps, and other symbols were issued.', 'title': 'Golden Jubilee of Queen Elizabeth II'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Dame Helen Lydia Mirren, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} ("née" Mironoff; born 26 July 1945) is an English actor. Mirren began her acting career with the Royal Shakespeare Company in 1967, and is one of the few performers who have achieved the Triple Crown of Acting, having won the Academy Award for Best Actress in 2007, after two previous nominations, for her performance as Queen Elizabeth II in "The Queen". She received an Olivier Award for Best Actress in 2013 for her West End performance in "The Audience", in which she also portrayed Elizabeth II, and in 2015 she won the Tony Award for Best Actress in a Play for her Broadway performance in the play. "The Audience" was written by Peter Morgan, who also wrote "The Queen". Mirren won three consecutive BAFTA Awards for Best Actress between 1992 and 1994 and her first of several Emmy Awards in 1996 for her performance as police detective Jane Tennison on the British television series "Prime Suspect", which ran for seven seasons between 1991 and 2006.', 'title': 'Helen Mirren'}]

