 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"A New Year" is a song by American singer Annaleigh Ashford, with Will Van Dyke and Jeff Talbott. The song was written by Van Dyke and Talbott. It was released on iTunes and Van Dyke\'s website on December 2nd, 2016. "A New Year" is an Easy Listening track. In addition to writing music and lyrics, Van Dyke is featured on piano on the single. The track also features Alec Berlin (guitar), Steve Gilewski (bass), Mason Ingram (drums), and Allison Seidner (cello). The song was recorded in New York City and was mixed by Grammy Award Winner Derik Lee, and Ian Kagey. Oscar Zambrano mastered the recording.', 'title': 'A New Year'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Another Time (Andrew\'s Song)" is a song by American singer Annaleigh Ashford and her close friend and music artist, Will Van Dyke. The song was written by Van Dyke and produced by Derik Lee. It was released on iTunes and Van Dyke\'s website on January 14, 2014. It was written for Van Dyke\'s fiancé, casting associate Andrew Femenella, and is featured in Ashford\'s cabaret show, "Lost in the Stars" . "Another Time (Andrew\'s Song)" is an Easy Listening track. In addition to writing music and lyrics, Van Dyke is featured on piano on the single. The track also features Michael Aarons (guitar), Steve Gilewski (bass), Sammy Merendino (drums), Philip Payton (violin/viola), and Allison Seidner (cello). It was recorded at Harlem Parlour Recording, NYC by Derik Lee, who also mixed and mastered the recording.', 'title': "Another Time (Andrew's Song)"}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Joost van Dyk (sometimes spelled Joost van Dyke) was a Dutch privateer (and, reportedly, sometime pirate) who was one of the earliest European settlers in the British Virgin Islands in the seventeenth century, and established the first permanent settlements within the Territory. The islands of Jost Van Dyke and its smaller neighbor Little Jost Van Dyke ("Little Jost"), as well as Little Dix Bay on Virgin Gorda island, are named after him.', 'title': 'Joost van Dyk'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Enrique Echeverría Vázquez (19231972) was a Mexican painter, part of the Generación de la Ruptura and early member of the Salón de la Plástica Mexicana. He was one of a number of painters who broke away from the established painting figurative style in Mexico in the mid 20th century to experiment with abstractionism and other modern movements in painting from Europe. Although his career was followed by other artists and critics, he died in the early 1970s when painters of his generation were only beginning to receive widespread recognition for their work. While meriting two major exhibits at the Palacio de Bellas Artes in Mexico City, one just after his death and a retrospective thirty years later in 2003, he and his work are not well known among younger Mexican painters.', 'title': 'Enrique Echeverría'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Manuel Quiroga (15 April 189219 April 1961) was a noted Galician violinist of the early 20th Century, whose career was cut short by a traffic accident in New York in 1937. He was repeatedly billed by music critics as "the finest successor of Pablo de Sarasate", and he is sometimes referred to as "Sarasate\'s spiritual heir". Enrique Granados, Eugène Ysaÿe and other composers dedicated compositions to him. The greatest violinists of the time – Ysaÿe, Fritz Kreisler, George Enescu, Mischa Elman and Jascha Heifetz – as well as composers such as Igor Stravinsky and Jean Sibelius, held Quiroga\'s artistry in great regard. Guilhermina Suggia, the Portuguese cellist (and one-time companion of Pablo Casals), described his playing of Tartini\'s "Devil\'s Trill Sonata" as "marvellous and flawless".', 'title': 'Manuel Quiroga (violinist)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Enrique Banchs (1888 – 1968) was an Argentine poet. He published all his work in the space of four years at the beginning of the 20th century, then lay dormant until his death. In his four works, "Las barcas" (1907), "El libro de los elogios" (1908), "El cascabel del halcón" (1909) and "La urna" (1911). Banchs cultivated an ephemeral, classicistic style drawing inspiration from the Siglo de Oro. His final work was composed in sonnets, a form which had already been almost completely abandoned by that time. Banchs published nothing during the final fifty years of his life, but he remained a part of the Argentine literary scene, and a member of the Argentine Academy of Letters. He was friend of Carlos Alberto Leumann.', 'title': 'Enrique Banchs'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Lionel S. Reiss (1894–1986) was a Polish-American Jewish painter born in Jaroslaw, Poland, and grew up on the Lower East Side of Manhattan where he studied commercial art. His family had moved to the United States in 1898 when he was four years old. As immigrants to the United States, Reiss’ parents joined the ranks of other Eastern European Jews who were fleeing their native countries at the start of the 20th century. Lionel Reiss' family settled on New York’s Lower East Side neighborhood and Reiss himself spent the majority of his life in the city. Reiss worked as a commercial artist for newspapers, publishers, and a motion picture company. Eventually he became art director for Paramount Studios and is credited to be the creator of the Leo the Lion logo of Metro-Goldwyn-Mayer Studios.", 'title': 'Lionel S. Reiss'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Carreras Cigarette Factory is a large art deco building in Camden, London in the United Kingdom. It is noted as a striking example of early 20th Century Egyptian Revival architecture. The building was erected in 1926-28 by the Carreras Tobacco Company owned by the Russian-Jewish inventor and philanthropist Bernhard Baron on the communal garden area of Mornington Crescent, to a design by architects M.E and O.H Collins and A.G Porri. It is 550 feet (168 metres) long, and is mainly white,', 'title': 'Carreras Cigarette Factory'}
