 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'John Lionel Darby (20 November 1831 – 5 November 1919) was Dean of Chester in the last decades of the 19th century and the first two of the 20th', 'title': 'John Darby (Dean of Chester)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Enrique Grau (December 18, 1920 – April 1, 2004) was a Colombian artist, renowned for his depictions of Amerindian and Afro-Colombian figures. He was a member of the triumvirate of key Colombian artists of the 20th century which included Fernando Botero and Alejandro Obregón.', 'title': 'Enrique Grau'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Concepció Badia Millàs (14 November 1897 – 2 May 1975) (known by her stage name as Conchita Badía or Conxita Badia) was a Spanish soprano and pianist. Admired for her spontaneity, expressiveness, and clear diction, she was considered one of the greatest interpreters of 20th century Catalan, Spanish and Latin American art song. She premiered many works in that genre, including those by Enrique Granados, Manuel de Falla, Frederic Mompou, Alberto Ginastera, and Enric Morera, several of which had been specially written for her voice. The main part of the collection of Badia\'s sound recordings, scores, letters and pictures is preserved in the Biblioteca de Catalunya. In one of the letters, Pablo Casals wrote: "Everything I\'ve written for a soprano voice has been thinking about you. Therefore, every one is yours."', 'title': 'Conchita Badía'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Enrique Carreras (January 6, 1925 - 29 August 1995) was a Peruvian-born Argentine film director, screenwriter and film producer, and was one of the most prolific film directors in the history of the Cinema of Argentina.', 'title': 'Enrique Carreras'}]

