 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Vartan Pasha (Armenian: Վարդան փաշա ), (Hovsep Vartanian or Osep Vartanian) (1813 - 1879) was an Ottoman Armenian statesman, author, and journalist of the 19th century, promoted to the rank of "Pasha" after three decades in the service of the state. He is also notable for his novel "Akabi\'s Story" ("Akabi Hikayesi"), published in 1851 in Turkish written in the Armenian script (a not unusual practice in the 19th century), and for having published the bilingual magazine "Mecmua-i Havadis", an important reference in the history of the Turkish written press.', 'title': 'Vartan Pasha'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Science Supercourse is a free online accessible educational resource currently encompassing more than 165,000 downloadable PowerPoint lectures covering four main areas of science; Public Health, Computer Engineering, Environment and Agriculture. It represents an extension to ""Supercourse"" initiative which started out at the University of Pittsburgh by scientist Ronald LaPorte in the 80\'s. It is mirrored at the Library of Alexandria, and networks over 56,000 scientists in 174 countries. Being a useful tool for at least one million students from around the globe, Supercourse has been a well-established starting point which triggered the emergence of the new Science Supercourse in 2008 with a wider scope in terms of content and functionalities.', 'title': 'Science Supercourse'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Gerold (died 799) was an Alamannian nobleman who served the Frankish King, Charlemagne, as Margrave of the Avarian March and Prefect of Bavaria in what is now South-Eastern Germany. Gerold played a significant role in the integration of Bavaria into the Frankish Kingdom during Carolingian expansion in the late 8th, and early 9th centuries. Gerold both aided the continuity of Agilofing rule of Bavaria, as well as took steps to integrate Bavarians into the wider scope of the Frankish Kingdom. Gerold was related both to the Agilofing family, the ruling class of Bavaria, as well as the Carolingian family. The Agilofings had ruled Bavaria since Duke Garibald I in 548. Gerold was born into the Agilofings, and his sister Hildegard was married to Charlemagne in 771. From these familial connections, he was appointed Prefect of Bavaria following the deposition of Duke Tassilo III in 788. Gerold was heralded as a superb military commander, giving rise to his promotion to Prefect as a defender of the eastern border of the Frankish Kingdom. In 799, Gerold is said to have fallen in battle against the Avars, shortly after the same Avars killed his ally, Erich, Duke of Friuli, through treachery.', 'title': 'Gerold, Prefect of Bavaria'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Slavery in Libya has a long history and a lasting impact on the Libyan culture. It is closely connected with the wider context of slavery in north Africa. Therefore, it is better understood when this wider scope is taken into account.', 'title': 'Slavery in Libya'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Hovsep Pushman (Armenian: Յովսէփ Փուշման ; May 9, 1877 – February 13, 1966) was an American artist of Armenian background. He was known for his contemplative still lifes and sensitive portraits of women, often in exotic dress. He was most closely associated during his lifetime with the Grand Central Art Galleries, which represented him from its opening in 1922 until his death in 1966.', 'title': 'Hovsep Pushman'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Grand Central Art Galleries were the exhibition and administrative space of the nonprofit Painters and Sculptors Gallery Association, an artists' cooperative established in 1922 by Walter Leighton Clark together with John Singer Sargent, Edmund Greacen, and others. Artists closely associated with the Grand Central Art Galleries included Hovsep Pushman, George de Forest Brush, and especially Sargent, whose posthumous show took place there in 1928.", 'title': 'Grand Central Art Galleries'}
