[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Halldór Kiljan Laxness (] ; born Halldór Guðjónsson; 23 April 1902 – 8 February 1998) was a twentieth-century Icelandic writer. Laxness wrote poetry, newspaper articles, plays, travelogues, short stories, and novels. Major influences included August Strindberg, Sigmund Freud, Sinclair Lewis, Upton Sinclair, Bertolt Brecht and Ernest Hemingway. In 1955 he was awarded the Nobel Prize in Literature; he is the only Icelandic Nobel laureate.', 'title': 'Halldór Laxness'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Timothy Francis Leary (October 22, 1920 – May 31, 1996) was an American psychologist and writer known for advocating the exploration of the therapeutic potential of psychedelic drugs under controlled conditions. Leary conducted experiments under the Harvard Psilocybin Project during American legality of LSD and psilocybin, resulting in the Concord Prison Experiment and the Marsh Chapel Experiment. Leary\'s colleague, Richard Alpert (Ram Dass), was fired from Harvard University on May 27, 1963 for giving psilocybin to an undergraduate student. Leary was planning to leave Harvard when his teaching contract expired in June, the following month. He was fired, for "failure to keep classroom appointments", with his pay docked on April 30. National illumination as to the effects of psychedelics did not occur until after the Harvard scandal.', 'title': 'Timothy Leary'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The following is a list of notable films produced in Iceland by Icelanders. Star marked films are films in coproduction with Iceland. Although Arne Mattsson is Swedish, his film is included because it is based on a book by the Icelandic Nobel Prize-winning author Halldór Laxness.', 'title': 'List of Icelandic films'}
