 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Independent People (Icelandic: "Sjálfstætt fólk" ) is an epic novel by Nobel laureate Halldór Laxness, originally published in two volumes in 1934 and 1935; literally the title means "Self-standing [i.e. self-reliant] folk". It deals with the struggle of poor Icelandic farmers in the early 20th century, only freed from debt bondage in the last generation, and surviving on isolated crofts in an inhospitable landscape.', 'title': 'Independent People'}
