 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Einar Arnórsson (24 February 1880 – 29 March 1955) was Minister for Iceland from 4 May 1915 to 4 January 1917. Einar graduated in Law from the University of Copenhagen in 1906. He was elected to Althingi and sat there in 1914–1919 and 1931–1932 for the Independence party. He was Minister of Education and Justice in Björn Þórðarson\'s cabinet from 1942 to 1944. He was professor of Law at the University of Iceland from 1911 to 1915 and again after leaving office as Minister for Iceland from 1917 to 1922. He was a Supreme Court Judge in 1932–1942 and again in 1944–1945. He was president of the University of Iceland in 1918–1919 and 1929–1930. For a short time he was father-in-law to Halldór Laxness. He was editor of "Ísafold" and "Morgunblaðið" in 1919–1920.', 'title': 'Einar Arnórsson'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Auður Sveinsdóttir Laxness (1918-2012) was an Icelandic writer and craftswoman, credited with influencing the design and popularity of the Icelandic Lopapeysa sweater during the mid-20th century. Her husband was Icelandic Nobel Literature laureate Halldór Laxness, and Auður worked as his secretary and writing collaborator for many years.', 'title': 'Auður Laxness'}]

