[{'idx': 0, 'is_supporting': True, 'paragraph_text': "The Kansas City Chiefs are a professional American football team based in Kansas City, Missouri. The Chiefs compete in the National Football League (NFL) as a member club of the league's American Football Conference (AFC) West division. The team was founded in 1960 as the Dallas Texans by businessman Lamar Hunt and was a charter member of the American Football League (AFL) (they are not associated with an earlier Dallas Texans NFL team that only played for one season in 1952). In 1963, the team relocated to Kansas City and assumed their current name. The Chiefs joined the NFL as a result of the merger in 1970. The team is valued at just under $1 billion.", 'title': 'Kansas City Chiefs'}
