 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Dallas Texans played in the National Football League (NFL) for one season, 1952, with a record of 1–11. The team is considered one of the worst teams in NFL history, both on (lowest franchise winning percentage) and off the field. The team was based first in Dallas, then Hershey, Pennsylvania, and Akron, Ohio, during its only season. The Texans were the last NFL team to fold. Many players on the 1952 roster went to the new Baltimore Colts franchise in 1953. The American Football League (AFL) had a 1960 charter member named the Dallas Texans (who later became the Kansas City Chiefs), but the AFL Texans have no relationship with the earlier NFL team.', 'title': 'Dallas Texans (NFL)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Francis Marion "Cotton" Davidson (born November 30, 1931) is a former American football quarterback. Davidson attended Baylor University, and played professionally for the National Football League\'s Baltimore Colts (1954, 1957), and the American Football League\'s Dallas Texans (1960–1962) and Oakland Raiders (1962–1968). Davidson also played quarterback for the Fort Bliss Falcons in 1955 to 1957. A game between the Fort Bliss Falcons and the Fort Sill, Oklahoma Cannoneers was played for a trophy called "The Little Brown Dud." The Cannoneers won the game and took home the Little Brown Dud. Cotton was awarded ALL ARMY QUARTERBACK in 1955.', 'title': 'Cotton Davidson'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The following is a detailed history of the Kansas City Chiefs, a professional American football franchise that began play in 1960 as the Dallas Texans. The team was a charter member of the American Football League (AFL), and now is currently part of the National Football League (NFL) (they are not associated with an earlier Dallas Texans NFL team that only played for one season in 1952).', 'title': 'History of the Kansas City Chiefs'}
