 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Theodore William Greene (January 25, 1932 – April 16, 1982) was an American football linebacker who played three seasons in the American Football League (AFL) with the Dallas Texans. Greene played college football at the University of Tampa. He was a member of the Dallas Texans team that won the 1962 AFL championship.', 'title': 'Ted Greene (American football)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Frank Hardin Jackson (born April 14, 1939) is a former American football wide receiver. He played college football at Southern Methodist University (SMU) and professionally with the American Football League's Dallas Texans, the Kansas City Chiefs, and the Miami Dolphins. As a halfback, he scored four TDs (two rushing, two receiving) for the Texans in a 49–21 victory over the Denver Broncos in 1961. As a wide receiver, in 1964 he caught four touchdown passes from Len Dawson in a 49–6 Chiefs defeat of the San Diego Chargers. That tied the pro football record at the time. He was an American Football League All-Star in 1965. He played on the Texans' 1962 AFL Championship team, winning the longest pro football game ever played up to that time in the AFL Championship game against the two-time defending AFL Champion Houston Oilers.", 'title': 'Frank Jackson (American football)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 1960 NFL expansion draft was the first National Football League (NFL) draft in which a new expansion team, named the Dallas Rangers, selected its initial players. The NFL awarded Dallas, Texas a franchise to compete for revenue with Lamar Hunt's Dallas Texans of the upstart American Football League. The Dallas expansion franchise was approved too late for it to participate in the 1960 NFL draft which had been held on November 30, 1959. Dallas is the only NFL expansion team to not have had the benefit of a college draft in its first year.", 'title': '1960 NFL expansion draft'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Johnny Stark (born May 29, 1972) is a Canadian-American soccer forward who spent most of career with indoor soccer teams. He currently coaches with the Dallas Texans youth club.cHe played for the Dallas Sidekicks.Stark (born May 29, 1972 in Vancouver, British Columbia, Canada) was a Canadian-American soccer forward who spent most of career with indoor soccer teams. Stark currently coaches with the Dallas Texans youth club.On April 23, 1993, the Dallas Sidekicks of the Continental Indoor Soccer League selected Stark in the first round (fifth overall) of the CISL Supplemental Draft. The team moved to Fort Worth in the spring of 1990 where it spent a single season as the North Texas United. Although born in Canada, Stark grew up in Texas, graduating in 1990 from Sam Houston High School. 1988, he began playing for the Addison Arrows in the Southwest Independent Soccer League (SISL) during the league’s first outdoor season. At the time, he was the youngest player in the league at age 16. On April 23, 1993, the Dallas Sidekicks of the Continental Indoor Soccer League selected Stark in the first round (fifth overall) of the CISL Supplemental Draft. He played two seasons in Dallas before being traded to the Houston Hotshots on August 15, 1994. After retiring from playing, Stark entered coaching, currently working for the Dallas Texans.', 'title': 'Johnny Stark (soccer)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Fear, Anxiety & Depression is a 1989 American comedy film written and directed by Todd Solondz and starring Solondz, Stanley Tucci and Jill Wisoff.', 'title': 'Fear, Anxiety &amp; Depression'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Life During Wartime is a 2009 American comedy-drama film written and directed by Todd Solondz, which premiered at the 2009 Venice Film Festival. It is a direct, but loose sequel to his 1998 film "Happiness", with new actors playing the same characters. It stars Allison Janney, Shirley Henderson, and Ciarán Hinds, among others.', 'title': 'Life During Wartime (film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Jason Kliot (born 1963) is an American independent film producer based in New York. Kliot emerged with the American indie wave of the 1990s, producing alongside his wife and business partner Joana Vicente. In 1995 Kliot and Vicente associate produced Todd Solondz\'s feature debut, "Welcome to the Dollhouse", which won the Sundance Grand Jury Prize. Kliot and Vicente have since worked with directors such as Steven Soderbergh, Brian De Palma, Hal Hartley, Nicole Holofcener, Jim Jarmusch, and Alex Gibney.', 'title': 'Jason Kliot'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'James Chinlund (born March 17, 1971) was born and raised in New York City. He studied Fine Art at CalArts in Los Angeles, with a focus on sculpture and large scale installation work. After graduating, Chinlund returned to New York and started his career in film, first as a carpenter, before finding opportunities as a Production Designer on music videos and independent films. During this period he first worked with frequent collaborator Darren Aronofsky ("Requiem for a Dream", "The Fountain") in addition to other directors in the New York independent film world including: Todd Solondz ("Storytelling"), Paul Schrader ("Auto Focus") and Spike Lee ("25th Hour"). Over the years James has been active in the worlds of commercials and fashion as well. Collaborators include: Inez van Lamsweerde and Vinoodh Matadin, Rupert Sanders, Spike Jonze, Fredrik Bond, Lance Acord, Gus Van Sant and Harmony Korine. In 2010 he won both the Art Directors Guild and the AICP awards for "Absolut World", a commercial collaboration with director Rupert Sanders. After a short break from features to care for his young daughter, Chinlund returned to the feature world in 2012 to work on "The Avengers" for Marvel which set a record for the highest grossing opening weekend of all time. In 2015 he was nominated for an Art Director’s Guild Award and the Saturn Award for his work on the Fox film "Dawn of the Planet of the Apes" directed by Matt Reeves. Most recently James has completed work on the next film in the Apes series "War for the Planet of the Apes".', 'title': 'James Chinlund'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Edward Lachman, A.S.C. (born March 31, 1948) is an American cinematographer and director. Lachman is mostly associated with the American independent film movement, and has served as director of photography on films by Todd Haynes (including "Far From Heaven" in 2002, which earned Lachman an Academy Award nomination), Ulrich Seidl, Wim Wenders, Steven Soderbergh and Paul Schrader. His other work includes Werner Herzog\'s "La Soufrière" (1977), "Desperately Seeking Susan" (1985), Sofia Coppola\'s directorial debut, "The Virgin Suicides" (1999), Robert Altman\'s last picture "A Prairie Home Companion" (2006), and Todd Solondz\'s "Life During Wartime" (2009). He is a member of the American Society of Cinematographers.', 'title': 'Edward Lachman'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Daniel Mann, also known as Daniel Chugerman (August 8, 1912 – November 21, 1991), was an American film and television director.', 'title': 'Daniel Mann'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Wiener-Dog is a 2016 American dark comedy-drama film directed and written by Todd Solondz. Starring an ensemble cast led by Ellen Burstyn, Kieran Culkin, Julie Delpy, Danny DeVito, Greta Gerwig, Tracy Letts, and Zosia Mamet, the film serves as a spin-off from Solondz\'s 1995 film "Welcome to the Dollhouse", which also features the character of Dawn Wiener.', 'title': 'Wiener-Dog (film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Storytelling is a soundtrack by Scottish indie pop band Belle and Sebastian. It is the score to the Todd Solondz movie "Storytelling". Belle and Sebastian experienced many problems in communication with Solondz while scoring the film, and as such only about six minutes of their music was actually used in the movie . The album contains five tracks that are recorded dialogues. The instrumental track "Fuck This Shit" uses the prosody of the title phrase in a number of different keys but never the words themselves. It was the band\'s final release on Jeepster, as they went on to sign a deal with Rough Trade the following year.', 'title': 'Storytelling (Belle and Sebastian album)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Palindromes is a 2004 American comedy-drama film written and directed by Todd Solondz. It references Solondz\'s 1995 film, "Welcome to the Dollhouse". It competed for the Golden Lion award at the 61st Venice International Film Festival.', 'title': 'Palindromes (film)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Todd Solondz (born October 15, 1959) is an American independent film screenwriter and director known for his style of dark, thought-provoking, socially conscious satire. Solondz has been critically acclaimed for his examination of the "dark underbelly of middle class American suburbia," a reflection of his own background in New Jersey. His work includes "Welcome to the Dollhouse" (1995), "Happiness" (1998), "Storytelling" (2001), "Palindromes" (2004), "Life During Wartime" (2009), "Dark Horse" (2011), and "Wiener-Dog (2016).', 'title': 'Todd Solondz'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Brit Awards (sometimes stylised as the BRIT Awards; often simply called the Brits) are the British Phonographic Industry\'s annual pop music awards. The name was originally a shortened form of "British", "Britain" or "Britannia" (in the early days the awards were sponsored by Britannia Music Club), but subsequently became a backronym for British Record Industry Trusts Show. In addition, an equivalent awards ceremony for classical music, called the Classic Brit Awards, is held each May. Robbie Williams holds the record for the most Brit Awards, 13 as a solo artist and another five as part of Take That.', 'title': 'Brit Awards'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The O2 Arena (temporarily the sponsor-neutral "North Greenwich Arena", during the 2012 Summer Olympics and 2012 Summer Paralympics), is a multi-purpose indoor arena located in the centre of The O2 entertainment complex on the Greenwich Peninsula in south-east London. The arena was built under the former Millennium Dome, a large dome-shaped building built to house an exhibition celebrating the turn of the third millennium; as the dome-shaped structure still stands over the arena, "The Dome" remains a name in common usage for the venue. The arena, as well as the total O2 complex, is named after its primary sponsor, the telecommunications company O.', 'title': 'The O2 Arena'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Electric is a Norwegian songwriting and production duo, composed of Henrik Barman Michelsen and Edvard Førre Erfjord. Perhaps best known for their work with Little Mix on their #1 UK hits Black Magic and Shout Out to My Ex, the latter of which won Single of the Year at the 2017 Brit Awards, they have worked with artists such as Olly Murs, Machine Gun Kelly, Hailee Steinfeld, The Wanted, Cheryl Cole, and Fifth Harmony.', 'title': 'Electric (music producers)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The 2009 Brit Awards ceremony took place on Wednesday 18 February 2009. It was the 29th edition of the British Phonographic Industry's annual pop music awards. The awards ceremony was held at Earls Court in London, and was broadcast live on ITV on 18 February at 8pm (GMT). Duffy became the first female artist to ever win three awards in the same year, and only Blur, in 1995, have ever won more awards at a single ceremony. The show was advertised as live by ITV but the broadcast included several audio deletions which means the show was shown on a time delay system. The 2009 Brit Awards ceremony was watched by 5.49 million people and was the 32nd most watched programme on TV on the week ending 22 February.", 'title': '2009 Brit Awards'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Laura Beatrice Marling (born 1 February 1990) is a British folk singer-songwriter and musician from Eversley, Hampshire. Her debut album "Alas, I Cannot Swim", her second album "I Speak Because I Can", and her fourth album "Once I Was an Eagle" were each nominated for the Mercury Music Prize in 2008, 2010, and 2013, respectively. She won the Brit Award for Best British Female Solo Artist at the 2011 Brit Awards, and was nominated for the same award at the 2012, 2014 and 2016 Brit Awards.', 'title': 'Laura Marling'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The Classic BRIT Awards (previously Classical BRIT Awards) are an annual awards ceremony held in the United Kingdom covering aspects of classical and crossover music, and are the equivalent of pop music's Brit Awards.", 'title': 'Classic Brit Awards'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Rory Charles Graham (born 29 January 1985), better known as Rag\'n\'Bone Man, is an English singer-songwriter. His first hit single "Human" was released in 2016 and his debut album, also named "Human", was released in February 2017. At the 2017 Brit Awards he was named British Breakthrough Act and also received the Critics\' Choice Award.', 'title': "Rag'n'Bone Man"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The 2018 Brit Awards will be held on 21 February 2018. It will be the 38th edition of the British Phonographic Industry's annual pop music awards. The awards ceremony will be held at The O2 in London and will be presented by Michael Bublé, who had to pull out of hosting at the previous Brit Awards due to his son having cancer.", 'title': '2018 Brit Awards'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Glory Days is the fourth studio album by British girl group Little Mix. It was released on 18 November 2016, by Syco Music and Columbia Records. The album was preceded by the UK number-one single "Shout Out to My Ex", released a month before. The single later won the Best British Single award at 2017 BRIT Awards. The album debuted at number one on the UK Albums Chart; it later became their first album to yield more than two top ten singles when the fourth single, "Power", reached number six on the UK Singles Chart. The album has sold over 600,000 copies in the U.K and over 1 million copies worlwide.', 'title': 'Glory Days (Little Mix album)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The 2017 Brit Awards was held on 22 February 2017 and was the 37th edition of the British Phonographic Industry\'s annual pop music awards. The awards ceremony were held at The O2 Arena in London. Emma Willis hosted "The Brits Are Coming", the launch show to reveal this year\'s nominees which was broadcast live for the first time, on 14 January 2017. Robbie Williams was given the Brits Icon Award the previous November during a special concert held in his honour at Troxy in London. Architect Zaha Hadid designed the Brit Award statuette that was to be given to the winners.', 'title': '2017 Brit Awards'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Hellyeah is an American heavy metal supergroup, consisting of Mudvayne vocalist Chad Gray, former Nothingface guitarist Tom Maxwell, bass player Kyle Sanders, guitarist Christian Brady and former Pantera and Damageplan drummer Vinnie Paul. The idea to form a supergroup originated in 2000 on the Tattoo the Earth tour, although plans were constantly put on hold due to scheduling conflicts. The summer of 2006 allowed the band to take the project seriously and record its first album. Recorded at Chasin\' Jason studio in Dimebag Darrell\'s backyard, a self-titled album was completed in roughly one month. Released on April 10, 2007, the album entered the "Billboard" 200 at number 9, selling 45,000 copies. AllMusic reviewer William Ruhlmann stated the album is "a competent example of its genre" awarding the album three and a half stars.', 'title': 'Hellyeah'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'By the People, for the People is a compilation album by American heavy metal band Mudvayne. It was released on November 27, 2007 by Epic Records. The album features a track listing chosen entirely by the band\'s fans, with the band determining which version appears on the record (e.g. live, demo, acoustic), as well as two new songs, "Dull Boy" and a cover of The Police\'s song "King of Pain" (both produced by Dave Fortman). If the album was pre-ordered through the Sony Music Store, it was packaged with a free lithograph of the lyrics to "Dull Boy", signed and numbered by Mudvayne vocalist Chad Gray. If it was ordered after the disc was released, the lithograph was shipped approximately three weeks later and was neither signed nor numbered.', 'title': 'By the People, for the People'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Beast Is Back is the seventh album by a newly reformed Blue Cheer, 13 years after their previous album, "Oh! Pleasant Hope" (1971). It contains re-recorded versions of some of the band\'s most popular songs from their late-1960s heyday as well as new material. The album features founding members Dickie Peterson and Paul Whaley. Original guitarist Leigh Stephens did not participate in the reunion.', 'title': 'The Beast Is Back'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Thank You" is the third single by heavy metal band Hellyeah from their debut album "Hellyeah". The song is a tribute to all of the band\'s recently departed family members: Vinnie Paul\'s brother Dimebag Darrell, Tom Maxwell\'s mother, and Chad Gray\'s grandmother. The song reached #37 on the "Billboard" Hot Mainstream Rock Tracks chart.', 'title': 'Thank You (Hellyeah song)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Chad Gray (born October 16, 1971), is the lead vocalist for the groove metal supergroup Hellyeah and former lead vocalist for American heavy metal band Mudvayne.', 'title': 'Chad Gray'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"Miracle" is a song by the band Nonpoint, released as the first single from their sixth studio album, "Miracle". The song was released to alternative and active rock radio stations on February 15, 2010. It was also made available for download on iTunes and other online music retailers on March 30. It features Chad Gray of Mudvayne fame contributing vocals during the song\'s chorus.', 'title': 'Miracle (Nonpoint song)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Miracle is the sixth studio album by American hard rock/metal band Nonpoint. The album's title track serves as its first single. This is the only Nonpoint album to feature guitarist Zach Broderick, who joined the band in late 2008 following the departure of original member Andrew Goldman. The album was recorded in Racine, WI and was produced by Mudvayne singer Chad Gray and guitarist Greg Tribbett.", 'title': 'Miracle (Nonpoint album)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Oh! Pleasant Hope is the sixth, and last, album by Blue Cheer until 1983\'s "The Beast Is Back". It features less psychedelia and hard rock and includes more folk rock elements. This is an unusual Blue Cheer album in that Dickie Peterson only sings lead on three songs. Another unusual aspect is that the song "I\'m the Light" features extensive use of the sitar and synthesizer, although on the previous album "The Original Human Being" the song "Babaji (Twilight Raga)" also featured extensive use of the aforementioned instruments.', 'title': 'Oh! Pleasant Hope'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Paul Whaley (born January 14, 1946) is an American drummer best known as the drummer for rock band Blue Cheer. He was the son of country music singer Paul Whaley Sr. He grew up in the towns of Vallejo and Winters California. He played drums with a Davis, California band called the Oxford Circle. Whaley is credited on the Oxford Circle album "Live at the Avalon 1966". When he left the Oxford Circle to join Blue Cheer in 1967, the former band dissolved. He was the longest-standing member in Blue Cheer other than founder Dickie Peterson in the band when it broke up in late 2009, following Peterson\'s death at age 63.', 'title': 'Paul Whaley'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Richard Allan Peterson (September 12, 1946 – October 12, 2009) was an American musician, best known as the bassist and lead singer for Blue Cheer. He also recorded two solo albums: "Child of the Darkness" and "Tramp".', 'title': 'Dickie Peterson'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'CBS Evening News is the flagship evening television news program of CBS News, the news division of the CBS television network in the United States. The program has been broadcast since May 3, 1948 under the original title "CBS Television News", eventually adopting its current title in 1963. Since June 19, 2017, the program is anchored by Anthony Mason on an interim basis. Previous anchors have included Douglas Edwards, Walter Cronkite, Dan Rather, Connie Chung, Bob Schieffer, Katie Couric and Scott Pelley.', 'title': 'CBS Evening News'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Reporters Committee for Freedom of the Press (RCFP) is an American nonprofit organization, founded in 1970, that provides free legal assistance to and on behalf of journalists. Its offices are located in Washington, D.C., and the executive committee is chaired by David Bordman. The steering committee includes Wolf Blitzer, Tony Mauro, Andrea Mitchell, and Judy Woodruff; Walter Cronkite was an active member from 1973 until his death in 2009. The organization publishes a quarterly magazine, "The News Media and The Law".', 'title': 'Reporters Committee for Freedom of the Press'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Sanford Socolow (November 11, 1928 – January 31, 2015) was an American broadcast journalist who worked at CBS News from 1956 to 1988. He was executive producer of "The CBS Evening News with Walter Cronkite" from 1978 to 1981.', 'title': 'Sanford Socolow'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'María Elena Salinas is an American broadcast journalist, news anchor, and author. Called the "Voice of Hispanic America" by "The New York Times", Salinas is one of the most recognized Hispanic female journalists in the United States. She is the co-anchor of "Noticiero Univision," the primary evening news broadcast on Univision, and the co-host of the news magazine program "Aquí y Ahora" ("Here and Now").', 'title': 'María Elena Salinas'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Randall Pinkston was a correspondent/anchor for Al Jazeera America. Previously he was with CBS News. After a stint as a White House Correspondent in CBS's Washington Bureau, Pinkston became a general assignment reporter, contributing to CBS broadcasts, including CBS Evening News, Morning News, Weekend News, CBS News Sunday Morning and 48 Hours. Pinkston also contributed to the CBS Reports documentary, Legacy of Shame with Correspondent Dan Rather. Pinkston has filled in as anchor on the CBS Evening News-Weekend Edition, Up to the Minute and CBS Morning News.", 'title': 'Randall Pinkston'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Roger Harrison Mudd (born February 9, 1928) is an American broadcast journalist, most recently working as the primary anchor for The History Channel. Previously, Mudd was weekend and weekday substitute anchor for the "CBS Evening News", the co-anchor of the weekday "NBC Nightly News", and the host of the NBC-TV "Meet the Press," and "American Almanac" TV programs. Mudd is the winner of the Peabody Award, the Joan Shorenstein Award for Distinguished Washington Reporting, and five Emmy Awards.', 'title': 'Roger Mudd'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Walter Leland Cronkite Jr. (November 4, 1916\xa0– July 17, 2009) was an American broadcast journalist, best known as anchorman for the "CBS Evening News" for 19 years (1962–1981). During the heyday of CBS News in the 1960s and 1970s, he was often cited as "the most trusted man in America" after being so named in an opinion poll.', 'title': 'Walter Cronkite'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Daniel Irvin Rather Jr. (born October 31, 1931) is an American journalist and the former news anchor for the "CBS Evening News." He was most recently managing editor and anchor of the television news magazine "Dan Rather Reports" on the cable channel AXS TV. Rather was anchor of the "CBS Evening News" for 24 years, from March 9, 1981, to March 9, 2005. He also contributed to CBS\'s "60 Minutes". Rather became embroiled in controversy about a disputed news report involving President George W. Bush\'s Vietnam-era service in the National Guard and subsequently left "CBS Evening News" in 2005, and he left the network entirely after 44 years in 2006.', 'title': 'Dan Rather'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Katherine Anne "Katie" Couric ( ; born January 7, 1957) is an American journalist and author. She recently served as Yahoo! Global News Anchor. Couric has been a television host on all Big Three television networks in the United States, and in her early career was an Assignment Editor for CNN. She worked for NBC News from 1989 to 2006, CBS News from 2006 to 2011, and ABC News from 2011 to 2014. In addition to her television news roles, she hosted "Katie", a syndicated daytime talk show produced by Disney–ABC Domestic Television from September 10, 2012, to June 9, 2014. Some of her most important notable roles include co-host of "Today", anchor of the "CBS Evening News", and correspondent for "60 Minutes". She also reported for nearly every television news broadcast across ABC, CBS and NBC. Couric\'s first book, "The Best Advice I Ever Got: Lessons from Extraordinary Lives", was a "New York Times" best-seller. In 2004, Couric earned induction into the Television Hall of Fame.', 'title': 'Katie Couric'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Terry Drinkwater (May 9, 1936 – May 31, 1989) was an American television and radio journalist most widely known for his quarter-century career as a correspondent for CBS News. Drinkwater was also an anchorman for the West Coast editions of the "CBS Evening News", covering events that occurred after the East Coast version with Walter Cronkite aired.', 'title': 'Terry Drinkwater'}]

