[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Montijo Air Base (Portuguese: "Base Aérea do Montijo" ) (ICAO: LPMT) - officially known as Air Base No. 6 ("Base Aérea n.º 6") or BA6 - is a military air base located in Montijo, Portugal. The base is home to three transport squadrons and one helicopter search and rescue squadron and provides logistic support to the Portuguese Navy\'s helicopters based there.', 'title': 'Montijo Air Base'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Attack Squadron 42 (VA-42) was a United States Navy attack squadron based at Naval Air Station Oceana, Virginia. The squadron was established as Fighter Squadron 42 (VF-42) on 1 September 1950, redesignated as VA-42 on 1 November 1953 and disestablished on 30 September 1994.', 'title': 'VA-42 (U.S. Navy)'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Naval Air Station Cecil Field or NAS Cecil Field (IATA: NZC,\xa0ICAO: KNZC,\xa0FAA LID: NZC) was a United States Navy air base, located in Duval County, Florida. Prior to October 1999, NAS Cecil Field was the largest military base in terms of acreage in the Jacksonville, Florida area.', 'title': 'Naval Air Station Cecil Field'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Attack Squadron 174 (VA-174) also known as the "Hellrazors" was a United States Navy attack squadron based at Naval Air Station Cecil Field, Florida, and were attached to Light Attack Wing One. The unit has evolved several times throughout its history that dates back to 1944. When it was established in March 1944 the unit was designated VB-81 flying the SB2C Helldiver. It was redesignated VA-13A on 15 November 1946. The unit was redesignated VA-134 on 2 August 1948 flying F-4U Corsairs, and redesignated VF-174 on 15 February 1950. The "Hellrazors" received their final designation VA-174 on 1 July 1966 after becoming the first US Navy squadron to receive the A-7A Corsair II. It was the second squadron to bear the VA-174 designation, the first VA-174 was disestablished on 25 January 1950. The squadron was disestablished on 30 June 1988.', 'title': 'Second VA-174 (U.S. Navy)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Electronic Attack Squadron 137 (VAQ-137) also known as the "Rooks", is a United States Navy electronic attack squadron based at Naval Air Station Whidbey Island Washington, flying the Boeing EA-18G Growler. The squadron is attached to Carrier Air Wing 1 (CVW-1), which is currently assigned to the USS\xa0"Theodore Roosevelt" . Their radio callsign is "Rook" and their tailcode is "AB" of CVW-1.', 'title': 'VAQ-137'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Naval Air Station Joint Reserve Base New Orleans is a base of the United States military located in Belle Chasse, unincorporated Plaquemines Parish, Louisiana, United States. NAS JRB New Orleans is home to a Navy Reserve strike fighter squadron and a fleet logistics support squadron, the 159th Fighter Wing (159 FW) of the Louisiana Air National Guard, Coast Guard Air Station New Orleans, a detachment of a Marine Corps Reserve light helicopter attack squadron, as well as other US Navy & US Army activities. The base has a 24/7 operating schedule to support both the 159 FW's NORAD air sovereignty/homeland defense requirements and for Coast Guard Air Station New Orleans search and rescue/maritime law enforcement/port security missions. It contains a military airport known as Alvin Callender Field (IATA: NBG,\xa0ICAO: KNBG,\xa0FAA LID: NBG) which is located three nautical miles (6\xa0km) south of the central business district of New Orleans. The base's predecessor, NAS New Orleans, occupied the current location of the University of New Orleans's principal campus until 1957.", 'title': 'Naval Air Station Joint Reserve Base New Orleans'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Osan Air Base (K-55; Korean: 오산공군기지 ; Hanja: 烏山空軍基地 ), is a United States Air Force base located near Songtan Station in the city of Pyeongtaek, South Korea, 64 km south of Seoul. Despite its name, Osan AB is not within Osan City, which is 7.5 km to the north. The base is the home of the Pacific Air Forces\' 51st Fighter Wing, and a number of tenant units, including the headquarters for Seventh Air Force. The base is also the headquarters of the ROK Air Force Operations Command. Osan Air Base is also the departure and arrival point for U.S. government-contracted "Patriot Express" flights bringing service members and their family members to South Korea from Seattle-Tacoma International Airport in the U.S. state of Washington, Misawa Air Base and Yokota Air Base in Japan.', 'title': 'Osan Air Base'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Attack Squadron 44 (VA-44) was an attack squadron of the United States Navy. Originally established as Bombing Squadron VB-75 on 1 June 1945 it was redesignated Attack Squadron VA-3B on 15 November 1946, redesignated VA-44 on 1 September 1948 and disestablished on 8 June 1950. A second VA-44 was in service from 1 September 1950 until disestablishment on 1 May 1970.', 'title': 'VA-44 (U.S. Navy)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Attack Squadron 75 (VA-75) or ATKRON 75 was an attack squadron of the United States Navy that was active from World War II through the 1990s. Nicknamed the "Sunday Punchers," they were based out of Naval Air Station Oceana, Virginia. Originally established as Bombing Squadron EIGHTEEN (VB-18) on July 20, 1943, it was redesignated Attack Squadron VA-7A on 15 November 1946, redesignated Attack Squadron VA-74 on 27 July 1948, redesignated Attack Squadron VA-75 on 15 February 1950 and disestablished on February 28, 1997. They were the second squadron to be designated VA-75, the first VA-75 was disestablished on 30 November 1949. They were the first fleet squadron to operate the A-6 Intruder and the last unit to fly it in operational service.', 'title': 'Second VA-75 (U.S. Navy)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Attack Squadron 65 (VA-65), nicknamed "The World Famous Fighting Tigers", was an attack squadron of the United States Navy. The squadron was established as Torpedo Squadron VT-74 in 1945, redesignated as VA-2B in 1946, as VA-25 on 1 September 1948, and finally redesignated VA-65 on 1 July 1959. It was disestablished in 1993. Known as "The World Famous Fighting Tigers", VA-65 was one of the last medium attack squadrons to fly the A-6 Intruder and the A-1 Skyraider. It was the second squadron to be designated VA-65, the first VA-65 was redesignated from VA-6B on 27 July 1948 and would be redesignated as VA-25 on 1 July 1959.', 'title': 'Second VA-65 (U.S. Navy)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The date of the start of the history of the United States is a subject of debate among historians. Older textbooks start with the arrival of Christopher Columbus on October 12, 1492 and emphasize the European background of the colonization of the Americas, or they start around 1600 and emphasize the American frontier. In recent decades American schools and universities typically have shifted back in time to include more on the colonial period and much more on the prehistory of the Native Americans.', 'title': 'History of the United States'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Available scientific evidence indicates that modern humans emerged from Africa over 100,000 years ago, yet did not arrive in the Americas until less than 20,000 years ago. Current understanding of the settlement of the Americas derives from advances in four interrelated disciplines: archaeology, Pleistocene geology, physical anthropology, and DNA analysis. While there is general agreement that the Americas were first settled from Asia, the pattern of migration, its timing, and the place(s) of origin in Asia of the peoples who migrated to the Americas remain unclear. In the 2000s, researchers sought to use familiar tools to validate or reject established theories, such as Clovis first. The archeological evidence suggests that the Paleo-Indians' first dispersal into the Americas occurred near the end of the last glacial period or, more specifically, what is known as the Last Glacial Maximum (LGM), around 16,500–13,000 years ago.", 'title': 'Settlement of the Americas'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'String is a long flexible structure made from fibers twisted together into a single strand, or from multiple such strands which are in turn twisted together. String is used to tie, bind, or hang other objects. It is also used as a material to make things, such as textiles, and in arts and crafts. String is a simple tool, and its use by humans is known to have been developed tens of thousands of years ago. In Mesoamerica, for example, string was invented some 20,000 to 30,000 years ago, and was made by twisting plant fibers together. String may also be a component in other tools, and in devices as diverse as weapons, musical instruments, and toys.', 'title': 'String (structure)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Cryptography, the use of codes and ciphers to protect secrets, began thousands of years ago. Until recent decades, it has been the story of what might be called classic cryptography — that is, of methods of encryption that use pen and paper, or perhaps simple mechanical aids. In the early 20th century, the invention of complex mechanical and electromechanical machines, such as the Enigma rotor machine, provided more sophisticated and efficient means of encryption; and the subsequent introduction of electronics and computing has allowed elaborate schemes of still greater complexity, most of which are entirely unsuited to pen and paper.', 'title': 'History of cryptography'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Richard G. Klein (born April 11, 1941) is a Professor of Biology and Anthropology at Stanford University. He is the Anne T. and Robert M. Bass Professor in the School of Humanities and Sciences. He earned his PhD at the University of Chicago in 1966, and was elected to the National Academy of Sciences in April 2003. His research interests include paleoanthropology, Africa and Europe. His primary thesis is that modern humans evolved in East Africa some 100,000 years ago and, starting 50,000 years ago, began spreading throughout the non-African world, replacing archaic human populations over time. He is a critic of the idea that behavioral modernity arose gradually over the course of tens of thousands, hundreds of thousands of years or millions of years, instead supporting the view that modern behavior arose suddenly in the Upper Paleolithic revolution around 50,000 or 40,000 years ago.', 'title': 'Richard Klein (paleoanthropologist)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The history of Native Americans in the United States began in ancient times tens of thousands of years ago with the settlement of the Americas by the Paleo-Indians. Anthropologists and archeologists have identified and studied a wide variety of cultures that existed during this era. Their subsequent contact with Europeans had a profound impact on their history.', 'title': 'History of Native Americans in the United States'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The most recent understanding of the evolution of insects is based on studies of the following branches of science: molecular biology, insect morphology, paleontology, insect taxonomy, evolution, embryology, bioinformatics and scientific computing. It is estimated that the class of insects originated on Earth about 480 million years ago, in the Ordovician, at about the same time terrestrial plants appeared. Insects evolved from a group of crustaceans. The first insects were land bound, but about 400 million years ago in the Devonian period one lineage of insects evolved flight, the first animals to do so. The oldest definitive insect fossil, "Rhyniognatha hirsti", is estimated to be  396 . Global climate conditions changed several times during the history of Earth, and along with it the diversity of insects. The Pterygotes (winged insects) underwent a major radiation in the Carboniferous (356 to 299 million years ago) while the Endopterygota (insects that go through different life stages with metamorphosis) underwent another major radiation in the Permian (299 to 252 million years ago).', 'title': 'Evolution of insects'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The use of terms and images referring to Native Americans/First Nations as the name or mascot for a sports team is a topic of public controversy in the United States and in Canada, arising as part of the Native American/First Nations civil rights movements. Since the 1960s, there have been a number of protests and other actions by Native Americans and others targeting the more prominent use of such names and images by professional franchises such as the Cleveland Indians and the Washington Redskins. However, the greatest change has occurred in the trend by school and college teams that have retired Native American names and mascots at an increasing rate in recent decades. The analysis of a database in 2013 indicates that there are currently more than 2,000 secondary schools with mascots that reference Native American culture, compared to around 3,000 fifty years ago. Many of these changes have been voluntary as the issue has been discussed at a local level. Statewide laws or school board decisions mandating change have been passed in states with significant Native American populations. Other states have official policies that encourage change in accordance with principles of establishing a proper environment for education. However, there has also been resistance and backlash.', 'title': 'Native American mascot laws and regulations'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The phrase Catholic youth work covers a wide range of activities carried out with young people, usually in the name of the Catholic Church and with the intention of imparting the Catholic faith to them and inviting them to practice and live out the faith in their lives. Activities in the field range from small scale youth groups attached to parishes or Catholic schools, to large international gatherings, such as World Youth Day. It is a field which has evolved much over recent decades, especially in comparison to more formal methods of education or catechesis within the church. Nearly all dioceses and a great deal of parishes have some form of youth provision running, although a great deal of areas particularly in the developed world are finding youth work both more difficult and rare as the numbers of young people regularly practicing the Catholic faith continue to decline. In contrast, though, the new and exciting developments of recent decades and particularly the influence of the new movements within the Church are ensuring that youth work continues to be an active and fruitful field.', 'title': 'Catholic youth work'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"The Human Revolution" is a term used by archaeologists, anthropologists and other specialists in human origins; it refers to the spectacular and relatively sudden – apparently revolutionary – emergence of language, consciousness and culture in our species. The term came into fashion following a conference on human origins held in the late 1980s, resulting in a 1989 edited volume entitled "The Human Revolution", edited by archaeologist Paul Mellars and palaeontologist Chris Stringer. In this early version, the rapid process of change was identified as the so-called \'Upper Palaeolithic Revolution\' which occurred in Ice Age Europe around 40,000 years ago, resulting in the displacement of the local Neanderthals by anatomically modern "Homo sapiens", with their sophisticated ivory tools, carved figurines and cave paintings. More recently, archaeologists have come to realise that if we can speak of a \'human revolution\' at all, it happened tens of thousands of years earlier, in sub-Saharan Africa rather than Europe. This means that the revolution was inseparable from the emergence of modern "Homo sapiens" in Africa between 150,000 and 200,000 years ago.', 'title': 'The Human Revolution (human origins)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Carlos Quintana (born November 6, 1976) is a retired Puerto Rican professional boxer. As an amateur Quintana represented Puerto Rico. He debuted as a professional in 1997. On February 24, 2006, he participated in his first professional championship fight, defeating Raul Bejerano for the World Boxing Organization's Latino welterweight championship. His first defense took place on June 24, 2006 when he defeated Joel Julio by unanimous decision in a welterweight title eliminator. In this fight he also won the World Boxing Council's Latino welterweight championship. His first world title fight took place on December 2, 2006, when he fought against Miguel Cotto for the World Boxing Association welterweight title. Cotto won the fight by technical knockout. On February 9, 2008, Quintana challenged Paul Williams for the WBO welterweight championship, winning the fight by unanimous decision. He entered the Light Middleweight division to face Deandre Latimore, knocking Latimore out to win the NABO Light Middleweight championship.", 'title': 'Carlos Quintana (boxer)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Kenneth Howard Norton Sr. (August 9, 1943 – September 18, 2013) was an American professional boxer who competed from 1967 to 1981, and held the WBC heavyweight title in 1978. He is best known for his trilogy with Muhammad Ali, in which Norton won the first fight by split decision, and controversially lost the latter two fights by split and unanimous decision, respectively. Norton also fought a slugfest with Larry Holmes in 1978, narrowly losing a split decision. Having officially retired from boxing in 1981, Norton was inducted into the International Boxing Hall of Fame in 1992.', 'title': 'Ken Norton'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'José "Carita" López (born March 29, 1972) is a Puerto Rican professional boxer who has competed in the flyweight and super flyweight divisions. His first professional championship was the Puerto Rican flyweight title, which won by defeating José Luis De Jesús. López\'s first championship opportunity was against Alberto Jiménez for the World Boxing Organization\'s flyweight title, in a contest that he lost by unanimous decision. This was followed by three more world championships fights, two of them for major titles. However, López lost these contests by unanimous decision. On June 23, 2001, López won the WBO Latino super flyweight title. After losing to Fernando Montiel in his fifth world title opportunity, he recurred to fight for regional championships. From 2001 to 2008, López compiled an undefeated record consisting of 14 wins and a single draw. On March 28, 2009, López defeated Pramuansak Phosuwan to win the WBO\'s super flyweight world championship.', 'title': 'José López (boxer)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'James Tillis (born July 5, 1957) is a former professional boxer. Known as "Quick", he was known for his fast hand speed. Tillis challenged for the WBA world heavyweight title in 1981, but was defeated by fifteen round unanimous decision to Mike Weaver. Tillis was the first man to go the distance with a prime Mike Tyson in 1986. He holds notable wins over Ron Stander by TKO 7 in 1980, and the hard punching Earnie Shavers by ten-round decision in 1982. Tillis fought for the last time in 2001 at the age of 44.', 'title': 'James Tillis'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'José "Cheíto" Ruíz Matos (October 24, 1966 – February 28, 1992) was a Puerto Rican boxer. Born and raised in the municipality of Trujillo Alto, he was signed as a professional when he was 17 years old. Ruíz made his debut July 13, 1984, competing in the super flyweight division. He gathered a record of 9-2 during the first three years of his career, which featured a trilogy against eventual contender, Pedro Jose Feliciano. Seeking to improve his standing in the world rankings, Ruíz challenged and defeated former World Boxing Council and Colombian champion, Prudencio Cardona and Chilean titlist Bernardo Manuel Mendoza. On April 29, 1989, he received his first opportunity for a world championship, defeating Sugar "Baby" Rojas for the title of the newly created World Boxing Organization. Ruíz had four successful defenses, defeating Juan Carazo, Ángel Rosario, Wilfredo Vargas and Armando Velasco. On February 22, 1992, Ruíz lost the title to José Quirino by unanimous decision. Five months later, he participated in the last fight of his career, losing a close majority decision to the International Boxing Federation\'s champion, Robert Quiroga. On February 28, 1992, Ruíz was ambushed and shot while traveling through one of San Juan\'s barrios, receiving six bullet wounds that fatally injured him.', 'title': 'José Ruíz Matos'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Juan Nazario (born September 27, 1963 in Guaynabo, Puerto Rico) is a former professional boxer. During his career, which lasted from 1982 to 1993, Nazario won the WBA world lightweight title. His first world title challenge came in 1987 when he fought fellow Puerto Rican Edwin Rosario for the WBA belt, Rosario won the fight by an eighth round knockout. Nazario and Rosario fought a rematch in 1990, once again for the WBA title. Nazario was able to reverse the result of the first fight by beating Rosario in the eighth round to become champion. In his first defense Nazario challenged Pernell Whitaker for the undisputed title. Whitaker won the fight in the first round and Nazario never fought for a world title again. Nazario fought for a final time on July 10, 1993, beating Angel Cordova by unanimous decision.', 'title': 'Juan Nazario'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Jimmy Garcia (October 12, 1971May 19, 1995) was a Colombian boxer who was best known for losing a WBC super featherweight title to Gabriel Ruelas and subsequently dying 13 days later from brain damage. The loss to Ruelas was the only stoppage loss of Garcia's career, and the former Colombian Featherweight champion's corner was criticized for not stopping the fight earlier. The Ruelas match had been Garcia's second successful title shot, having lost a unanimous decision to Genaro Hernández earlier.", 'title': 'Jimmy Garcia'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Leon Spinks (born July 11, 1953) is an American former professional boxer who competed from 1977 to 1995. In only his eighth professional fight, he won the undisputed heavyweight championship in 1978 after defeating Muhammad Ali via split decision, in what was considered one of the biggest upsets in boxing history. Spinks was later stripped of the WBC title for facing Ali in an unapproved rematch seven months later, which he lost by unanimous decision.', 'title': 'Leon Spinks'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Genaro Hernández (May 10, 1966 – June 7, 2011) was a Mexican-American professional boxer who competed from 1984 to 1998. He was a two-time super featherweight world champion, having held the WBA title from 1991 to 1995, and the WBC and lineal titles from 1997 to 1998. Additionally, he challenged for the WBO lightweight title in 1995.', 'title': 'Genaro Hernández'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Randall Craig "Tex" Cobb (born December 10, 1953) is an American former professional boxer who competed in the heavyweight division. Widely considered to possess one of the greatest chins of all time, Cobb was a brawler who also packed considerable punching power. He began his fighting career in full contact kickboxing in 1975 before making the jump to professional boxing two years later. He challenged Larry Holmes for the WBC heavyweight title in November 1982, losing a one-sided unanimous decision, and took wins over notable heavyweights of his era such as Bernardo Mercado, Earnie Shavers, and Leon Spinks.', 'title': 'Randall &quot;Tex&quot; Cobb'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Sangiliyan statue was dedicated to Cankili II a Tamil martyr and the last king of Jaffna Kingdom. The statue is seen as a landmark of the city of Jaffna. The Sangiliyan statue was built 1974 at Muuirai junction Nallur and declared open by then Jaffna Mayor Alfred Duraiappah. On 2011 was the statue removed and a new statue was built at the same place. The new statue was declared open by Jaffna Mayor Mrs. Yogeshwarai Patkunarajah and Minister Douglas Devananda. Tamil groups believe the statue was destroyed and rebuilt because of political motives. They criticize by this act was the historic beauty of the statue destroyed, the new statue has not the heroic features of the former statue, the sword in the hand of Cankili was removed by the government and reinstalled in another position.', 'title': 'Sangiliyan Statue'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Martyr's Memorial, also known as Shaheed Smarak, is a life-size statue of seven young men who sacrificed their lives in the Quit India movement (August 1942), to hoist the national flag on the (now) Secretariat building. The foundation stone of Martyr's Memorial was laid on 15 August 1947, by the governor of Bihar, Mr. Jairam Das Daulatram. The sculptor Deviprasad Roychoudhury built the bronze statue of the seven students with the national flag. These statues were cast in Italy and later placed here.", 'title': "Martyrs' Memorial Patna"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'King Charles the Martyr, or Charles, King and Martyr, is a title of Charles I, who was King of England, of Scotland, and of Ireland from 1625 until his execution on 30 January 1649. The title was used by high church Anglicans who regarded Charles\' execution as a martyrdom. His feast day in the Anglican calendar is 30 January, the anniversary of his execution in 1649. The cult of Charles the Martyr was popular with Tories. The observance was one of several "state services" removed in 1859 from the Book of Common Prayer of the Church of England and the Church of Ireland. There remain some churches and parishes dedicated to Charles the Martyr, and his cult is maintained by some Anglo-Catholic societies, including the Society of King Charles the Martyr founded in 1894.', 'title': 'King Charles the Martyr'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Martyr (Sahid) Dharma Bhakta Mathema is one of the revered freedom fighters of Nepal, who sacrificed his life in struggle for freedom against hereditary prime ministership of the Rana dynasty. He was a professional body builder as well as a founding member of Praja Parishad party of Nepal. He was hanged during the freedom movement, and he is duly recognized as one of the four martyrs of Nepal. His statue is found, along with other three martyrs, in the Martyr's Gate (Sahid Gate) memorial in Kathmandu. A school is also established on his name 'Shahid Dharma Bhakta School (SDB)' currently located in Nakkhu, Lalitpur, Nepal by her daughter Renu Devi which runs the classes from montessori to grade 10 (School Leaving Certificate). He is also said to have introduced modern body building techniques in Nepal.", 'title': 'Dharma Bhakta Mathema'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Saint George (, "Geṓrgios"; Latin: "Georgius" ; to 23 April 303), according to legend, was a Roman soldier of Greek origin and officer in the Guard of Roman emperor Diocletian, who was sentenced to death for failing to recant his Christian faith. As a Christian martyr, he later became one of the most venerated saints in Christianity and in particular the Crusades.', 'title': 'Saint George'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The Lady of the Valley (Arabic: سيدة الوادي\u200e \u200e , "Sayyidat al-Wadi") is a Marian shrine located in Al-Nasirah, Wadi al-Nasara in Syria. The statue is built near the Lady of the Valley Church on top of "Mount of the Pilgrim" (Arabic: جبل السائح\u200e \u200e , "Jabal al-Sayeh"), which is dedicated to Saint George.', 'title': 'Lady of the Valley'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The Shrine of Our Lady of Our Health, Hyderabad is the biggest octagonal church in Asia. It is one of the oldest Roman Catholic Churches of Hyderabad and is dedicated to Blessed Virgin Mary. It is situated near to Mahaveer Hospital, Masab Tank, Hyderabad and is in A.C. Guards, Khairtabad. In this church, the birthday of Blessed Virgin Mary is celebrated on 8 September every year. On the day of the feast and during the feast lakhs of people visit the Shrine to pay their respects to Blessed Virgin Mary. Every year the celebrations start with the Flag Hoisting on 29 August, after which a Novena to Our Lady Of Health is held daily in the evenings, when a parish from Hyderabad or Secundrabad comes to host the Holy Mass. After the mass, there is a procession with the Statue of Our Lady Of Health out in the grounds of the Church after which Benediction takes place. Even on First Saturday of every month, there's a Holy Mass conducted during which the Statue of Our Lady Of Health is taken out in the grounds of the Church where Benediction takes place and thousands of people attend the mass.", 'title': 'Shrine of Our Lady of Health'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The INA Martyr's Memorial complex is a war memorial at Moirang, India, dedicated to the soldiers of the Indian National Army. The main feature of the complex is a reconstruction of the INA's memorial to its fallen soldiers as it stood in Singapore, before its destruction at the hands of British-Indian Army sappers in 1945. The complex also contains a museum dedicated to the INA along with a library and an auditorium and a statue of Subhas Chandra Bose. Work on the cenotaph itself began in October 1968 and was completed in September 1969, when it was unveiled by Indira Gandhi. Work on expanding the monument complex to present-day size was completed in 2005, when it was unveiled. The total cost in building the memorial was Rs 6.23 crores. A stone monument has also been erected at the historic Moirang Kangla, where Colonel S. A. Malik leading an INA unit raised the flag of Azad Hind in April 1944. The Imphal state government has administered the site since 1985. Close to the complex is the peace memorial at Lotpaching, raised by the Japanese government.", 'title': "INA Martyr's Memorial"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Our Lady of Aberdeen is a Madonna and Child statuette, a copy of a similar statuette in Brussels known as "Notre Dame du Bon Succès". Copies of "Notre Dame du Bon Succès" are to be found across the North East of Scotland. It is believed that the statue in Brussels may have been in Old Aberdeen as early as 1450. References to a statue in a Chapel at the Bridge of Dee in Aberdeen suggest that it may have been placed there by Bishop Gavin Dunbar of Aberdeen (1514–1531). At the beginning of the Scottish Reformation (c. 1559) many religious objects from churches in Aberdeen and the St Machar\'s Cathedral in Old Aberdeen were given for safe keeping to Catholic sympathisers. It is claimed that the statue was in the hands of a Catholic family, the Gordons of Strathbogie, until 1625. It was then sent to the Low Countries by a William Laing, thought to be the Procurer for the Kings of Spain to the Infanta Isabella Clara Eugenia in Brussels. There is a reliable history of "Notre Dame du Bon Succès" in Brussels from that date. In Scotland the Catholic Church celebrates 9 July as Our Lady of Aberdeen Day. There are copies in St Mary\'s Cathedral, Aberdeen and in the Bishop’s House, formerly the Convent of the Sacred Heart in Aberdeen. Other copies include one in Buckie and one in St Peter\'s Church in Aberdeen. For historic details of "Notre Dame du Bon Succès" and Our Lady of Aberdeen see the papers by Ray McAleese – below. The monograph by Ron Smith (see below) gives a devotional account of beliefs about Our Lady of Aberdeen and "Notre Dame du Bon Succès".', 'title': 'Our Lady of Aberdeen'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Saint Theonestus of Vercelli is venerated as a martyr by the Catholic Church. Theonestus may have been a member of the early Christian community in Vercelli, living in an era earlier than that of Eusebius of Vercelli. Theonestus may have been a martyr, whose relics were buried in the cemetery where other Christians were buried, outside the city walls. It is believed that his whole body was conserved in the tomb dedicated to him. He is probably not the saint of the same name who was said to have been killed at Altinum by the Arians. This saint of Altinum, whose legend, in any case, is confused and contradictory, may have been confused for the martyr of Vercelli, whose historicity is more certain.', 'title': 'Theonestus of Vercelli'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Premio Lo Nuestro 2003 was the 15th anniversary of the awards. the show was hosted by Mexican presenters Marco Antonio Regil and Adal Ramones. Juanes, Thalía, Marc Anthony, Pilar Montenegro, Sin Bandera, Banda el Recodo and other Latin music greats gave electrifying performances. In the show, there was 36 awards winners with 135 nominations. In Pop genre, Awards was given for : Album of the Year, Best Male Artist, Best Female Artist, Best Group or duo, Best New Artist and Song of the Year. In Rock Genre : Best Rock Album and Best rock Performer of the Year. In Tropical genre : Best Tropical Album of the Year, Best Tropical Male Artist, Best Tropical Female Artist, Best Tropical Group or Duo of the Year, Best Tropical New Artist, Tropical Song of the Year, Best Merengue Performance, Best Salsa Performance and Best Traditional Performance. Juanes was the biggest winner of night, took home four awards Best Pop Male Artist, Best Music Video, Best Rock Performance, and Pop Song of the Year . In the Regional Mexican, Pilar Montenegro took three awards for Regional Mexican Song of the Year, Pop Song of the Year ("Quitame Ese Hombre"), and for Best Regional Mexican Female Artist. In the tropical genre, Celia Cruz took home with four great awards of the night for Best Salsa Performance, Best Tropical Female Artist, Best Tropical Song of the year and Tropical Album of the Year. At the night, the greatest performance was a medley of top Latin hits from the last 15 years, performed by the artists that made them famous, including Vikki Carr, Son by Four, Los Ilegales, La Mafia, Luis Enrique, Wilfrido Vargas and Olga Tañón. There was a great tribute to Celia Cruz by the world-famous salsa group "Fania All-Stars", of which Cruz was a member during the 1970s, reunited for an exclusive performance that rocked the house.', 'title': 'Premio Lo Nuestro 2003'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Encore (stylized as ƎNCORE) is the fifth studio album by American rapper Eminem. It was released by Aftermath Entertainment, Shady Records, and Interscope Records. Its release was set for November 16, 2004, but was moved up to November 12 (coincidentally, exactly eight years to the day since his debut album, "Infinite", was released) after the album was leaked to the Internet. "Encore" sold 710,000 copies in its first three days, and went on to sell over 1.5 million copies in its first two weeks of release in the United States, certified quadruple-platinum that mid-December. Nine months after its release, worldwide sales of the album stood at 11 million copies. By December 2016, the album had sold over 5 million copies in the United States and more than 23 million copies worldwide.', 'title': 'Encore (Eminem album)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'SAIC-GM-Wuling Automobile (上汽通用五菱汽车股份有限公司 and abbreviated as SGMW) is a joint venture between SAIC Motor, General Motors, and Liuzhou Wuling Motors Co Ltd. Based in Liuzhou, Guangxi Zhuang Autonomous Region, in southwestern China, it makes commercial and consumer vehicles sold in China under the Wuling and Baojun marques, respectively. A major mass-volume producer in the Chinese interior, in 2011 SGMW sold 1,286,000 vehicles in China, 1,445,000 in 2012, and aims to sell 2 million cars annually. Its offerings range in price from US$5,000 to US$10,000.', 'title': 'SAIC-GM-Wuling'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Japan Record Award for Best New Artist (最優秀新人賞 ) is awarded annually. Until the 10th Japan Record Awards it was called New Artist Award, since 11th — Best New Artist Award. At present all nominees for the Best New Artist Award are awarded the New Artist Award.', 'title': 'Japan Record Award for Best New Artist'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Robson & Jerome is the debut studio album by British singing duo Robson & Jerome. It was released in the UK in 1995 by RCA Records, and reached number one on the UK Albums Chart. It was the Christmas number one album of 1995, and was the biggest-selling album of the year, with sales of 2,040,000. For almost 20 years, it held the record for selling 2 million copies in the UK in the fastest time, doing so in 42 days; in 2015, Adele surpassed the record when her album "25" took just 29 days to reach the landmark.', 'title': 'Robson &amp; Jerome (album)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The MTV Video Music Award for Best New Artist have been given out since the first annual MTV Video Music Awards in 1984. From then to 2006, the award was named Best New Artist in a Video. In 2007 its name was changed to Best New Artist, as the category underwent a format change to award the artist's body of work for the full year rather than a specific video. For the 2008 ceremony, though, while the award retained its 2007 name, it returned to the format of awarding a specific video rather than the artist's full body of work. The category was later renamed Artist to Watch through 2013 to 2015 while still keeping the format of an award going to a certain video.", 'title': 'MTV Video Music Award for Best New Artist'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Foundation is the first major-label studio album by American country music band Zac Brown Band. It was released on November 18, 2008. Originally slated for release on the Home Grown label and Big Picture Records, the album is distributed by Atlantic Nashville in association with those two labels. The financing for the album was provided by Atlanta, GA entrepreneur Braden Copeland through his investment company Braden Copeland Ventures, LLC. On December 2, 2009, the album was nominated for the Grammy Award for Best Country Album. and also earned the band the Grammy Award for Best New Artist on January 31. The album also has been nominated for the 2010 Academy of Country Music Awards "Album of the Year" award. As of September 2015, the album has sold 3.4 million copies in the US.', 'title': 'The Foundation (Zac Brown Band album)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Adele Laurie Blue Adkins (born 5 May 1988) ( ) is an English singer-songwriter. After graduating from the BRIT School for Performing Arts and Technology in 2006, Adele was given a recording contract by XL Recordings after a friend posted her demo on Myspace the same year. In 2007, she received the Brit Awards "Critics\' Choice" award and won the BBC Sound of 2008 poll. Her debut album, "19", was released in 2008 to commercial and critical success. It is certified seven times platinum in the UK, and three times platinum in the US. The album contains her first song, "Hometown Glory", written when she was 16, which is based on her home suburb of West Norwood in London. An appearance she made on "Saturday Night Live" in late 2008 boosted her career in the US. At the 51st Grammy Awards in 2009, Adele received the awards for Best New Artist and Best Female Pop Vocal Performance.', 'title': 'Adele'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The highest-selling albums and EPs in the United States are ranked in the "Billboard" 200, published by "Billboard" magazine. The data are compiled by Nielsen Soundscan based on each album\'s weekly physical and digital sales. 25 acts achieved number one albums during this year with artist such as Nelly and Shania Twain who had their albums debut at number one on the chart. Rapper Eminem\'s "The Eminem Show" is the best selling album of 2002 selling over approximately 7.6 million copies by the end of the year. It is also the longest running album of 2002 spending six non-consecutive weeks the chart and was known for its first full week of sales debut of 1.322 million copies which Nielsen SoundScan scanned as the sixth largest sales of all time in its first week. Its debut of 1.322 million copies has still not been matched by any album today since except for Taylor Swift\'s album "1989", which opened with first week sales of 1.279 million copies. The band Creed continued its eight week long run on the chart but is credited as the longest running album 2001. Jennifer Lopez earned her second number one album on the charts with "", which became the highest first week sales of a remix album at the time. R&B artist Ashanti earned her first number one album with her self-titled debut album "Ashanti", which opened up with first week sales of 503,000 copies in its first week alone. Puff Daddy earned his first number one album since "No Way Out" back in 1997. Rapper Jay-Z earned his fifth chart topper with "", which opened up with first week sales of 545,000 copies alone. Heavy metal band Disturbed earned its first number one album on the chart with "Believe", which opened up with first week sales of 284,000 copies alone. Country music singer Shania Twain\'s album "Up! " opened up with a huge first week sales of 857,000 copies in its first week alone, giving her the recognition of the highest first week sales of her career and second highest of the year, only behind Eminem\'s "The Eminem Show" and at the time the fastest selling solo female album ever. Nelly\'s album "Nellyville" opened up with his highest first week sales of his career which logged on with huge sales of 714,000 copies in its first week alone, which beat his sales of his debut album "Country Grammar", which opened up with first week sales of 235,000 copies. Country singer Alan Jackson album "Drive" gave him his first number one album on the chart and opened up with first week sales of 211,000 copies alone.', 'title': 'List of Billboard 200 number-one albums of 2002'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Every End of the Day" () is a song by South Korean singer-songwriter and actress IU. It was released as a CD single, titled "Spring of a Twenty Year Old" (). The single has a double A-side hit singles, "Peach" and "Every End of the Day" which was also released digitally, consists of three tracks in total, one of which was composed by IU. It is the singer\'s first Korean-language release since the full-length album, "Last Fantasy", that was released six months prior. . The latter topped "Billboard" Korea K-Pop Hot 100 for four consecutive weeks, making it IU\'s second number-one hit on the chart after "You and I". The single has sold over 34,400 copies in South Korea as of 2013.', 'title': 'Every End of the Day'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Twicecoaster: Lane 2 (stylized as TWICEcoaster : LANE 2) is the reissue of South Korean girl group Twice\'s third extended play (EP) "". It was released digitally and physically on February 20, 2017 by JYP Entertainment. It contains 13 tracks, including the lead single, "Knock Knock".', 'title': 'Twicecoaster: Lane 2'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Stray Kids () is an upcoming reality show created by JYP Entertainment and Mnet. It is a male idol debut project with the concept of winning the "trainees versus JYP" survival. It is set to air on October 17, 2017 at 23:00 KST.', 'title': 'Stray Kids'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Twice (; Japanese: トゥワイス) is a South Korean girl group formed by JYP Entertainment through the 2015 reality show "Sixteen". The group is composed of nine members: Nayeon, Jeongyeon, Momo, Sana, Jihyo, Mina, Dahyun, Chaeyoung, and Tzuyu. The group debuted on October 20, 2015 with the extended play (EP) "The Story Begins".', 'title': 'Twice (band)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Live at O2 Shepherds Bush Empire is KT Tunstall\'s sixth live album, recorded on 9 November 2016. It features many tracks from her previous albums, with the second half of the double album containing many tracks from her 2016 release "KIN". Tunstall was accompanied by a three-piece band consisting of Rachel Eckroth on keyboard, Solomon Dorsey on bass, and Denny Weston Jr. on drums.', 'title': 'Live at O2 Shepherds Bush Empire'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Wonder Girls () was a South Korean girl group and band formed by producer Park Jin-young under JYP Entertainment in 2006, which debuted in 2007. The group's final line-up consisted of Yubin, Yeeun, Sunmi and Hyerim. Members Sunye and Sohee officially left the group in 2015, while Hyuna left in late 2007. They were co-managed in the United States by Creative Artists Agency.", 'title': 'Wonder Girls'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Day6 (, stylized as DAY6) is a South Korean rock band formed by JYP Entertainment. The band\'s current line-up consists of five members: Jae, Sungjin, Young K, Wonpil, and Dowoon. The band debuted with the release of their first EP, "The Day" on September 7, 2015.', 'title': 'Day6'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '2PM (Hangul:\xa0투피엠 ) is a South Korean boy band formed by JYP Entertainment. The current members are Jun. K (formerly known as Junsu), Nichkhun, Taecyeon, Wooyoung, Junho and Chansung. Former leader Jay Park officially left the group in early 2010.', 'title': '2PM'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'South Korea-based girl group Twice have released four extended plays (one of which was reissued under a different title), one compilation album, one compilation EP, and five singles. Formed by JYP Entertainment in 2015 through the survival show "Sixteen", Twice debuted in October 2015 with the release of their first EP, "The Story Begins", and its single "Like Ooh-Ahh". The EP and the single peaked at No. 3 and No. 10 on the Gaon Music Chart, respectively. "The Story Begins" eventually sold over 120,000 copies, becoming the best-selling debut extended play by a K-pop girl group of all time, breaking the record set by Girls\' Generation\'s first extended play "Gee" (2009), which sold nearly 100,000 copies.', 'title': 'Twice discography'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Sixteen (, stylized as SIXTEEN) was a 2015 reality girl group survival show created by JYP Entertainment and Mnet. The show pitted sixteen JYP trainees against one another to secure a spot in the girl group Twice. "Sixteen" contestants were assessed for not only their singing and dancing abilities but also their charisma and personality. The show premiered on May 5, 2015, and ran for ten episodes through July 7, 2015, on Mnet.', 'title': 'Sixteen (TV series)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Sunrise is the first studio album by South Korean rock band Day6. It was released by JYP Entertainment on June 7, 2017. This album features 14 tracks which consists of all 10 tracks that were previously released from January to May 2017 through "Every Day6", tracks from "Every Day6 June", rebooted version of "Letting Go", and final version of "Congratulations".', 'title': 'Sunrise (Day6 album)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'PJ & Duncan, who were later rebranded as Ant & Dec, began their musical career in 1993 with the release of the single "Tonight I\'m Free". This was followed in 1994 by their successful debut album "Psyche", which included the single "Let\'s Get Ready to Rhumble". Their second album "Top Katz" (1995) was less commercially successful than "Psyche" although all its singles reached the UK Top 20. PJ & Duncan were rebranded as Ant & Dec in 1996, resulting in 1997\'s "The Cult of Ant & Dec", their final album, which reached 15 in the UK charts. Their label, Telstar Records, decided not to renew their recording contract in 1997, and their career in music ended there. They reunited for live performances in 2000 and 2013 and for a single, "We\'re on the Ball", in 2002.', 'title': 'PJ &amp; Duncan discography'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Anthony McPartlin, OBE (born 18 November 1975) and Declan Donnelly, OBE (born 25 September 1975), known collectively as Ant & Dec, are an English comedy TV presenting, television producing, acting and former music duo from Newcastle upon Tyne, England.', 'title': 'Ant &amp; Dec'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Let's Get Ready (LGR) is a non-profit organization that provides low-income high school students with free SAT preparation, admissions counseling and other support services needed to gain admission to and graduate from college. Programs are based at colleges, staffed by college student volunteers. Let's Get Ready is the largest network of student-run college access programs in the U.S., serving approximately 2,500 U.S. high school students per year.", 'title': "Let's Get Ready (organization)"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Psyche is the debut studio album released by British recording duo PJ & Duncan, now better known as Ant & Dec. Recording on the album began in 1993, following the release of a track the duo performed during their time on Byker Grove, "Rip it Up". The song was then re-worked into their debut single, "Tonight I\'m Free", which was released in December 1993 on Telstar Records. The album includes the duo\'s best known track, "Let\'s Get Ready to Rhumble", which peaked at no. 9 on the UK Singles Chart.', 'title': 'Psyche (album)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Ain\'t Too Proud to Beg" is a 1966 song and hit single by The Temptations for Motown Records\' Gordy label, produced by Norman Whitfield and written by Whitfield and Edward Holland, Jr. The song peaked at number 13 on the Billboard Pop Chart, and was a number-one hit on the Billboard R&B charts for eight non-consecutive weeks. The song\'s success, in the wake of the relative underperformance of the previous Temptations single, "Get Ready", resulted in Norman Whitfield replacing Smokey Robinson, producer of "Get Ready", as The Temptations\' main producer. In 2004 it finished #94 in AFI\'s 100 Years...100 Songs poll thanks to its inclusion in "The Big Chill" soundtrack.', 'title': "Ain't Too Proud to Beg"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"I Guess I Like It Like That" is a 1991 promotional single written by Australian singer-songwriter Kylie Minogue and British producers Mike Stock and Pete Waterman for Minogue\'s fourth album "Let\'s Get to It". The song samples 2 Unlimited\'s "Get Ready For This" written by Phil Wilde, Jean-Paul de Coster and Ray Slijngaard. In the 2015 UK re-release of the "Let\'s Get To It" album Wilde and de Coster were credited as co-authors of the song (Stock/Waterman/Minogue/DeCoster/Wilde). The song also samples Freestyle Orchestra\'s "Keep On Pumping It Up" and the Salt-N-Pepa song "I Like It Like That".', 'title': 'I Guess I Like It Like That'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': '"Let\'s Get Ready to Rhumble" is a 1994 song by British duo Ant & Dec, who at the time were known as PJ & Duncan. The song was released in the United Kingdom on 11 July 1994 as the third single from their debut studio album "Psyche". The song was written by Nicky Graham, Deni Lew and Mike Olton, and produced by Nicky Graham. It peaked at number 9 in the UK Singles Chart in 1994, and was later #1 almost two decades after its original chart appearance. The song includes a repeatedly-used sample of Michael Buffer saying his trademark catchphrase.', 'title': "Let's Get Ready to Rhumble"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Get Ready is the second album of gospel group, Virtue. The album features the singles, "Get Ready", "Love Me Like You Do", "Angels Watching Over Me" and "Put Your War Clothes On". Member Shavonne Sampson would depart the group and would be replaced by members Ebony & Karima\'s younger sister Heather Trotter.', 'title': 'Get Ready (Virtue album)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'People Get Ready is an album by American soul music group the Impressions, released in 1965. It contains Curtis Mayfield\'s "People Get Ready", which was a successful single that had a significant impact on the civil rights movement. The album reached number one on the Billboard R&B chart and 23 on the main Billboard chart.', 'title': 'People Get Ready (The Impressions album)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Get Ready" is a Motown song written by Smokey Robinson, which resulted in two hit records for the label: a U.S. No. 29 version by The Temptations in 1966, and a U.S. No. 4 version by Rare Earth in 1970. It is significant for being the last song Robinson wrote and produced for the Temptations, due to a deal Berry Gordy made with Norman Whitfield, that if "Get Ready" did not meet with the expected degree of success, then Whitfield\'s song, "Ain\'t Too Proud To Beg", would get the next release, which resulted in Whitfield more or less replacing Robinson as the group\'s producer.', 'title': 'Get Ready (The Temptations song)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'An electric musical instrument is one in which the use of electric devices determines or affects the sound produced by an instrument. Electric musical instruments are an example of electric music technology. It is also known as an amplified musical instrument due to the common utilization of an electronic instrument amplifier to project the intended sound as determined by electric signals from the instrument. Two common types of instrument amplifiers are the guitar amplifier and the bass amplifier. This is not the same as an electronic musical instrument, like a synthesizer, which uses entirely electronic means to both create and control sound.', 'title': 'Electric instrument'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Ali Akbar Mousavi Khoeini \xa0\xa0 (Persian: علی اکبر موسوی خویینی\u200e \u200e ) (also known as Seyed Ali Akbar Mosavi) is a notable Iranian human rights activist and politician. He was an active member of Tahkim vahdat before he was elected as a Member of Parliament in the 6th Parliament of Iran. In the parliament, he made a significant attempt to defend the rights of political prisoners during the 1990s. He is currently the president of Advar Tahkim Vahdat.', 'title': 'Ali-Akbar Mousavi Khoeini'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Ali Akbar Khan (14 April 192218 June 2009) was a Hindustani classical musician of the Maihar gharana, known for his virtuosity in playing the sarod. Trained as a classical musician and instrumentalist by his father, Allauddin Khan, Khan also composed several classical "ragas" and film scores. He established a music school in Calcutta in 1956, and the Ali Akbar College of Music in 1967, which moved with him to the USA and is now based in San Rafael, California, with a branch in Basel, Switzerland.', 'title': 'Ali Akbar Khan'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Ali Akbar Natiq is an Urdu poet and short story writer from Pakistan. Ali Akbar Natiq began working as a mason, specializing in domes and minarets, to contribute to the family income while he read widely in Urdu and Arabic. Acclaimed as one of the brightest stars in Pakistan’s literary firmament, Natiq has published two volumes of poetry and one collection of short stories. His latest has been featured in "Granta" magazine\'s special issue on Pakistan.', 'title': 'Ali Akbar Natiq'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Ali Akbar Bahman (also Mirza Ali Akbar Khan; b. 1883 - d. 1967) was an Iranian employee of the Foreign Ministry, diplomat and politician under the Qajar and Pahlavi dynasties. Ali Akbar Bahman was during the rule of the Qajar dynasty as well as at the time of Reza Shah Pahlavi ambassador and minister.', 'title': 'Ali Akbar Bahman'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "The Ali Akbar College of Music (AACM) is the name of three schools founded by Indian musician Ali Akbar Khan to teach Indian classical music. The first was founded in 1956 in Calcutta, India. The second was founded in 1967 in Berkeley, California, but moved to its current location in San Rafael, California the next year. The third was founded in 1985 in Basel, Switzerland and is run by Khan's disciple Ken Zuckerman.", 'title': 'Ali Akbar College of Music'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Achan (English: "Father" ) is a 2011 Malayalam-language film directed by Ali Akbar and starring Thilakan. The film is based on a drama of the same name written by S. R. Raveendran, who also scripted the film. The film\'s shooting began on 28 July 2010, and was scheduled to release by October. Several issues regarding the casting of Thilakan, an expelled member of the Association of Malayalam Movie Artists, led the film to a delayed release on 14 January 2011. Ali Akbar’s wife produced the film; the music was composed by his daughter.', 'title': 'Achan (2011 film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Mirza Hosseingholi, also known as "Agha Mirza Hosseingholi Farahani" (1853 in Tehran – 1916 in Tehran), was a musician and tar player. He and his older brother Mirza Abdollah started learning music from their father Ali Akbar Farahani who was a well-known musician. He is best known for his radif and for his unique style of playing tar. His best student was Ali Akbar Shahnazi, who collected and performed his father\'s radif.', 'title': 'Mirza Hossein-Qoli'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Music of India: Morning and Evening Ragas is the debut album by Indian sarod master Ali Akbar Khan, released in 1955. Issued on Angel Records, it is considered a landmark recording, being the first album of Indian classical music ever released. <ref name="Hunt/AAK obit">Ken Hunt, "Ustad Ali Akbar Khan: Sarod maestro who played with Ravi Shankar and appeared at the Concert for Bangladesh", "The Independent", 25 June 2009 (retrieved 3 December 2013). </ref>', 'title': 'Music of India: Morning and Evening Ragas'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Ali Akbar Shiroodi (Persian: علی\u200cاکبر شیرودی\u200e \u200e ) was one of the pilots who had the highest number of flights in the world. Ali Akbar Shiroodi, according to air-war experts, was one of the most prominent helicopter pilots in the world. They consider him a stylist pilot in flights and air combats, in a way that when attaching the enemy he would dive obliquely and maneuver like a jet plane. Also he had the highest number of flights in the world. He was injured 40 times and 300 times shelled. He defended the Iranian territories during the initial years of Iran-Iraq war.', 'title': 'Ali Akbar Shiroodi'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The 1927 New South Wales state election to elect the 90 members of the 28th Legislative Assembly was held on 8 October 1927. During the previous parliament the voting system, which had been a form of proportional representation with multi-member seats and a single transferable vote (modified Hare-Clark), was changed to single member constituencies with optional preferential voting. Severe divisions occurred within the Australian Labor Party caucus in the four months prior to the election (see Lang Labor) and a caretaker government composed of the supporters of the Premier of New South Wales and party leader, Jack Lang was in power at the time of the election.', 'title': 'New South Wales state election, 1927'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Patrick Frederick Mooney (17 January 1880 – 23 December 1942) was an Australian politician. Born in Eurobodalla, New South Wales, he received a primary education before becoming a hotel manager and tram driver. He was an official with the Tramway Workers Union, and also served on Redfern Council, rising to be mayor in 1925. On 23 December 1931, New South Wales Premier Jack Lang installed Mooney as a Lang Labor member in a Senate vacancy that resulted from the death of Nationalist Senator Walter Duncan. Mooney's time in the Senate was short as the 1931 election had passed and Duncan's term was due to expire on 30 June 1932. He contested the 1934 election as a Lang Labor candidate but was unsuccessful. He remained an organiser of the Lang Labor group and a Redfern Alderman. Mooney died in 1942.", 'title': 'Patrick Mooney (Australian politician)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Thomas Patrick "Tom" Howard (13 March 1880 – 9 July 1949) was an Australian trade unionist and politician. He was a member of the South Australian House of Assembly from 1933 to 1938, representing the Lang Labor Party (1933), South Australian Lang Labor Party (1933–1934) and Australian Labor Party (1934–1938).', 'title': 'Tom Howard (politician)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Thomas "Tom" Sheehan (14 April 1891 – 26 March 1955) was an Australian politician. Born in Sydney, he attended Catholic schools before becoming an engine-driver and official of the Australian Federated Union of Locomotive Enginemen. He was involved in local politics as a member of Newtown City Council. In 1937, he was elected to the Australian House of Representatives as the Labor member for Cook. In 1940, when the New South Wales Caucus of the Labor Party split, Sheehan joined the Australian Labor Party (Non-Communist) under the leadership of Jack Lang. However, in 1941 John Curtin reunited the party, and Sheehan and the other Lang Labor members rejoined the federal ALP. He held the seat for the rest of his life. Thomas married Annie O\'Mara and had four children, Stanley, Thomas, May and Kenneth.', 'title': 'Tom Sheehan (politician)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'William Joseph "Bill" Denny, {\'1\': ", \'2\': ", \'3\': ", \'4\': "} (6 December 1872 – 2 May 1946) was a South Australian journalist, lawyer, politician and decorated soldier who held the South Australian House of Assembly seats of West Adelaide from 1900 to 1902 and then Adelaide from 1902 to 1905 and again from 1906 to 1933. After an unsuccessful candidacy as a United Labor Party (ULP) member in 1899, he was elected as an "independent liberal" in a by-election in 1900. He was re-elected in 1902, but defeated in 1905. The following year, he was elected as a ULP candidate, and retained his seat for that party (the Australian Labor Party from 1917) until 1931. Along with the rest of the cabinet, he was ejected from the Australian Labor Party in 1931, and was a member of the Parliamentary Labor Party until his electoral defeat at the hands of a Lang Labor Party candidate in 1933.', 'title': 'Bill Denny'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The Premier of New South Wales is the head of government in the state of New South Wales, Australia. The Government of New South Wales follows the Westminster system, with a Parliament of New South Wales acting as the legislature. The Premier is appointed by the Governor of New South Wales, and by modern convention holds office by virtue of his or her ability to command the support of a majority of members of the lower house of Parliament, the Legislative Assembly.', 'title': 'Premier of New South Wales'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Joseph Herbert Gander (1888 – 22 November 1954) was an Australian politician. Born in Dubbo, New South Wales, Australia, he received a primary education before becoming a billiardmaker and public servant. He was involved in local politics in Sydney, being elected to Newtown Council. In 1931, he was elected to the Australian House of Representatives as the member for Reid, a member of the Lang Labor party; he defeated Percy Coleman, the Labor member. When, in 1936, the Lang Labor members rejoined the Labor party, Gander was one of them. However, in 1940, the Labor Party split again, and Gander was among the members to join the Langite Australian Labor Party (Non-Communist). However, he was defeated in the election of that year by the federal Labor candidate, Charles Morgan, and retired from politics, returning to public service. Gander died in 1954.', 'title': 'Joe Gander'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'He was born at Rylstone to farmer John Orchard Taylor and Helen Russell, "née" Clarke. He attended Burwood Superior Public School before becoming a junior clerk with the State Department of the Attorney-General and of Justice in November 1912. He joined the Australian Labor Party at the age of seventeen and was active in the anti-conscription campaigns of 1916–17. He ran unsuccessfully for Ryde at the 1925 state election, but was expelled from 1927 to 1930. On his readmittance he was part of the Lang Labor faction, running for North Sydney as a Lang Labor candidate at the 1934 federal election. He was called to the Bar on 25 May 1934. He ran for the reunited Labor Party as the candidate for Martin in 1937.', 'title': 'Stan Taylor (barrister)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Australian Labor Party (NSW), commonly known as Lang Labor, was a political group arising from a major breakaway from the Australian Labor Party in New South Wales that operated from 1931 to 1936, when the two groups were reconciled.', 'title': 'Australian Labor Party (NSW)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The Lang Labor Party was a political party active in South Australia from 1931 to 1934, aligned with Lang Labor and the policies of Premier of New South Wales Jack Lang.', 'title': 'Lang Labor Party (South Australia)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'A small but recognizable people with Arab origins have over time settled in the India. Genealogically they are grouped as "Indo-Arabs" or "Indians with Arab ancestry". Those who arrived in Kerala and Gujarat for trading goods were later recruited to the army. Most Arabs were traders, and businessmen who sold or traded silk, diamonds and other valuables resulting in wealthy business men. The city of Surat and villages within the city are known for Arab settlements. Variav and Randev are the few villages that Arabs started their lives in. In Hyderabad, Chaush are Arab community of Hadhrami descent whose ancestors were recruited as soldier by Nizam of Hyderabad. In coastal Karnataka, Iraqis arrived during the reign of Tipu Sultan. They claim their ancestry from Banu Assad. These population migrations may have been favored by both the Nizam of Hyderabad and Tipu Sultan of Mysore because both had their ancestral linkages to these populations.The Asaf Jahi Dynasty claimed Arab ancestry from Asir Province and Tipu Sultan from the Bani Hashim of Hijaz Province in Arabia. Many Arabs having Adnani ancestry such as Quraishi, Ansari, Sayyid tribes and other descendants of the Sahaba were employed by the Princely States in their military as they were found efficient during warfare. In Kerala, Syed Thangals of Hadhrami descent settled around 17th century as missionaries to propagate Islam. There are also Shia Sayyids in Northern region of country who claim descent from Wasit, Iraq like Zaidis although many Arab genealogists dispute this fact. Sunni Sayyid of the country also claim Arab descent from Sufi missionaries. Most of the Sufis migrated from Persia. Sunni Sayyids claim their Arab ancestry through Imam Hassan or Imam Hussain in which case their names may be Hassani, Hussaini or Hashmi. Some also claim descent from both and are termed ""Najeeb AlTarfayn"" or "Noble on both sides". Many Sufi Saints such as Abdul-Qadir Gilani and Moinuddin Chishti and their descendants claim themselves as "Najeeb AlTarfayn" although many genealogists dispute this fact. Sunni Sheikhs also claim Arab descent from Sufis or migrants. They don\'t know their tribe but trace lineage from Umar - Farooqi, Abu Bakr- Siddiqui, Uthman - Usmani and Ali - Alawi or Mir, who established the Rashidun Caliphate. Many who can vaguely trace their lineage to the Quraish tribe call themselves QuraishiMany having the name Ansari claim their lineage to the Ansar tribes of Madina Munawwara and the companions of the Prophet Muhammad such as Abu Ayyub al-Ansari. Many of the present Sheikhs converted from Hindu castes such as Kayasth and Rajput.', 'title': 'Arabs in India'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Indian Scout is a motorcycle built by the Indian Motocycle Company from 1920 to 1949. It rivaled the Chief as Indian's most important model. The 101 Scout, made from 1928 to 1931, has been called the best motorcycle Indian ever made. A second line of Scouts, with lighter frames and reduced engine displacement, was introduced in 1932 alongside the Standard Scout, which replaced the 101 Scout and shared its frame with the Chief and the Four. The small-displacement Scout and the Sport Scout, introduced in 1934, were continued until the end of civilian production in 1942. Military versions of both models were used by US and other Allied forces during World War II.", 'title': 'Indian Scout (motorcycle)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Girl Scout Destinations, formerly Wider Opportunities or Wider Ops, are events for individual Girl Scouts (ages 11 – 18) hosted by GSUSA or individual Girl Scout councils. Most Destinations are held within the United States, though each year there are trips abroad, such as to allow participants to be part of the US delegation to another country's national jamboree, or a World Association of Girl Guides and Girl Scouts (WAGGGS) World Centre. They can range from two days to three weeks long. Most events are geared toward specified grade levels: Girl Scout Cadettes (6th - 8th grade), Girl Scout Seniors (9th and 10th grade), or Girl Scout Ambassadors (11th and 12th grade). Girls must go through an application process and sometimes an interview process before being chosen for a Destination.", 'title': 'Destinations'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Art Laboe (born Arthur Egnoian on August 7, 1925) is an Armenian American disc jockey, songwriter, record producer, and radio station owner, generally credited with coining the term "Oldies But Goodies".', 'title': 'Art Laboe'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Chinese Australians () are Australian citizens of Chinese ancestry. Chinese Australians are one of the largest groups of Overseas Chinese people, forming the largest Overseas Chinese community in Oceania. Per capita, Australia has more people of Chinese ancestry than any country outside of Asia. Many Chinese Australians are immigrants from Mainland China, Hong Kong, Macau, Taiwan, and other countries such as Indonesia, Malaysia, Singapore and the Philippines, while many are descendants of such immigrants. Chinese Australians are also a subgroup of Asian Australians and East Asian Australians and represent the single largest minority ethnicity in the country. As a whole, Australian residents identifying themselves as having Chinese ancestry made up 5.6% of those nominating their ancestry at the 2016 census and numbered 1,213,903.', 'title': 'Chinese Australians'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Original Sound is a Los Angeles, California-based record label. It was founded in the early 1950s by KPOP deejay Art Laboe. It began as a small label that specialized in compiling and re-releasing "oldies" R&B and rock \'n\' roll songs.', 'title': 'Original Sound'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Interamerican Scout Jamboree is the biggest event of the Interamerican Scout Region. It is held every four years in a different country of the region. The host country is elected during the Interamerican Scout Conference. Ecuador was announced as the host of the 15th Interamerican Scout Jamboree at the XXV Interamerican Scout Conference in Buenos Aires, Argentina, on 21 September 2013.', 'title': 'Interamerican Scout Jamboree'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "KOKO-FM is a classic hits radio station broadcasting from Kerman, California, for the Fresno area with studio and office located in Los Angeles, California. KOKO 94 is the home for the Art Laboe Connection, and The Art Laboe Sunday Night Special. Laboe, by the way, is the station's owner. Its transmitter is in Kerman.", 'title': 'KOKO-FM'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Scout Tufankjian is an Armenian-American photojournalist and author based in Brooklyn, New York. She is well known for her photos of American President Barack Obama during his campaign leading up to his presidency. She is also known for her photojournalism work on the Armenian diaspora.', 'title': 'Scout Tufankjian'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Since the publication of "Scouting for Boys" in 1908, all Scouts and Girl Guides around the world have taken a Scout (or Guide) promise or oath to live up to ideals of the movement, and subscribed to a Scout Law. The wording of the Scout Promise (or Oath) and Scout Law have varied slightly over time and from country to country. Some national organization promises are given below. Although most Scouting and Guiding organizations use the word "promise", a few such as the Boy Scouts of America tend to use "oath" instead. Typically, Scouts and Guides will make the three-fingered Scout Sign when reciting the promise.', 'title': 'Scout Promise'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'So You Think You Can Dance Scandinavia was an entry in the international "So You Think You Can Dance" franchise of dance competition television shows which represented Denmark, Norway, and Sweden.', 'title': 'So You Think You Can Dance Scandinavia'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Strictly Come Dancing (informally known as Strictly) is a British television dance contest, featuring contestants, celebrities, and other people, from all walks of life, with professional dance partners competing in a ballroom and Latin dance competition. Each couple is scored out of 10 by a panel of judges. The title of the show suggests a continuation of the long-running series "Come Dancing", with an allusion to the film "Strictly Ballroom". The format has been exported to over 40 other countries, and has also inspired a modern dance-themed spin-off "Strictly Dance Fever". The show is currently presented by Tess Daly and Claudia Winkleman.', 'title': 'Strictly Come Dancing'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Claudia Albertario Rodríguez (] ; born May 16, 1977) is an Argentine model, vedette and actress of theatre, television and film. Her notable credits include "Amigovios" (1995), "Como pan caliente" (1996), "Montaña rusa, otra vuelta" (1997), "Chiquititas" (1997–1999), "Gasoleros" (1998 and 1999), and "Verano del \'98" (1998–2001). She also appeared on "Dancing on Ice" around the world.', 'title': 'Claudia Albertario'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Strictly Come Dancing is a South African reality dance competition television series produced for SABC2 by Rapid Blue, based on the British show of the same name. It is broadcast live from the Carlton Centre Ballroom, Johannesburg, and it is hosted by Siphiwe Nhlapo. The show premiered in South Africa on SABC2 on Saturday 4 February 2006, at 20:00.', 'title': 'Strictly Come Dancing (South African TV series)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Dancing with the Stars is an American dance competition television series that premiered on June 1, 2005, on ABC. It is the US version of the UK series "Strictly Come Dancing". The show is hosted by Tom Bergeron, alongside Erin Andrews, who became co-host in season eighteen. Lisa Canning was co-host in the first season, Samantha Harris co-hosted seasons two through nine and Brooke Burke-Charvet in seasons ten through seventeen. On May 12, 2017, it was announced that the series has been renewed for season twenty six.', 'title': 'Dancing with the Stars (U.S. TV series)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Live to Dance is a United States television reality program and dance competition on the CBS network based on the British series "Got to Dance". Dancers from all over the country auditioned for "Live to Dance" in "specially constructed Dance Domes". Resembling the British dance competition series "Got to Dance", the show was first shown on January 4, 2011, and was headlined by the "American Idol" judge Paula Abdul as lead judge with Andrew Günsberg as host. Judging alongside Abdul were Kimberly Wyatt, the former member of Pussycat Dolls, and Michael Jackson\'s long-time choreographer Travis Payne. The show was intended to rival "So You Think You Can Dance" and unlike most other reality shows, allowed dancers of all ages to compete. The series was not renewed for a second season.', 'title': 'Live to Dance'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Dancing on Ice is a British made dance competition television series franchise produced around the world. The format, devised by London Weekend Television and Granada Television for ITV, has been a prime-time hit in eight different countries, including Britain and subsequently in Italy and Chile. In Australia, where it was titled "Torvill and Dean\'s Dancing on Ice", it was axed after just one series owing to production costs.', 'title': 'Dancing on Ice around the world'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Boogie Woogie Kids Championship was an Indian dance competition television series created and directed by Javed Jaffrey and Ravi Behl, owners of R&N TV Productions, for Sony Entertainment Television and Sony Entertainment Television Asia. Javed Jaffrey, Naved Jafri, and Ravi Behl are the permanent judges on the show.', 'title': 'Boogie Woogie Kids Championship'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Boogie Woogie was an Indian dance competition television series created and directed by Naved Jaffrey and Ravi Behl for Sony Entertainment Television and Sony Entertainment Television Asia. Debuting in 1996, the show was judged by Indian film actor and Television host Javed Jaffrey who was the permanent judge, while his brother Naved, also the director and producer of the show, co hosted the show along with film actor Ravi Behl. The early episodes were shot in Mehta Industrial Estate in Andheri, Mumbai and later, was also shot at other film studios in Mumbai including Natraj, Filmalaya, Filmistaan, Famous, Film City among others. It is the oldest dance reality show on Indian TV and it has become the longest show in India. In the earlier seasons, the judges assigned various themes to episodes, including Bollywood, Horror, Friendship among others. It was also co-hosted by Kadambari Shantshri Desai in season 1 and 2.', 'title': 'Boogie Woogie (TV series)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Teriya Phounja Magar is a dancer from Rudrapur, Rupandehi district, Nepal. Teriya Phounja Magar has become one of the famous celebrity of Nepal. She came into the public spot light during her performances on the dance competition television series "Dance India Dance Li\'l Masters" which she won on 21 June 2014. She is also the winner of Colors TV dance reality show "Jhalak Dikhhla Jaa (season 9)" which she won on 21 January 2017. Teriya Magar is the second daughter to her parents. Though her parents were expecting a son, but in present they are proud to be Teriya as their daughter.', 'title': 'Teriya Magar'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The sixth season of Nouvelle Star aired from February 31 to June 13, 2008. Virginie Efira hosted her third season. Novelties of the season were brought with a change in the judging panel as André Manoukian remained as the only former jury member. Next to him, Lio, Sinclair and Philippe Manœuvre judged the contestants for the first time. Also a veto power was introduced in which the judges had the right to save an eliminated contestant which they used at their very first opportunity. A similar element was later seen in the eighth season of "American Idol".', 'title': 'Nouvelle Star (season 6)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Donald J. Manoukian (June 9, 1934 – September 23, 2014) was an American football guard and professional wrestler of Armenian descent from Reno, Nevada.', 'title': 'Don Manoukian'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Viken L. Babikian is an American doctor of Armenian origin and professor of neurology at Boston University School of Medicine. Babikian attended the medical school at the American University of Beirut. He then went on to complete his Neurology residency at the University of Chicago Hospitals and a stroke fellowship at the Massachusetts General Hospital. He joined the Boston University Department of Neurology in 1986. He has been a pioneer in studying cerebrovascular disorders such as stroke, with numerous publications.', 'title': 'Viken Babikian'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Anthony McPartlin, OBE (born 18 November 1975) and Declan Donnelly, OBE (born 25 September 1975), known collectively as Ant & Dec, are an English comedy TV presenting, television producing, acting and former music duo from Newcastle upon Tyne, England.', 'title': 'Ant &amp; Dec'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Lại Văn Sâm 1958 in Phú Thọ, Vietnam) is a Vietnamese journalist, he was host of many television programs, such as "Đấu Trí" ("PokerFace"), "Đấu trường 100" ("1 vs 100"), "Chiếc nón kỳ diệu" ("Wheel of Fortune"), "Hãy chọn giá đúng" ("The Price Is Right"), "SV \'96", "SV 2000" and "Trò chơi liên tỉnh" and now he is the host of "Ai là triệu phú? " ("Who Wants to Be a Millionaire? ") and "Chúng tôi là chiến sỹ". He was also one of the founders of VTV3. He studied Hinduism for 12 years in the Soviet Union. On October 5, 2008 he received an award for being the most popular game show host of VTV.', 'title': 'Lai Van Sam'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'PokerFace is a British game show broadcast on ITV, where one person is guaranteed to win £1 million. The show was created by Ant & Dec, who also host it. As implied by the title, "PokerFace", is based on the bluffing aspect of poker games. The contestants do not necessarily need to get the questions right in order to win, and can bluff their way through the game and pressure their opponents into folding in order to win.', 'title': 'PokerFace'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Carl Philipp Gottfried (or Gottlieb) von Clausewitz ( ; 1 June 1780\xa0– 16 November 1831) was a Prussian general and military theorist who stressed the "moral" (meaning, in modern terms, psychological) and political aspects of war. His most notable work, "Vom Kriege" ("On War"), was unfinished at his death.', 'title': 'Carl von Clausewitz'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Classical Realism is a theory of International Relations established in the post-World War II era that seeks to explain international politics as a result of human nature. The theory is associated with thinkers such as Niccolò Machiavelli and Thomas Hobbes. Modern thinkers associated with classical realism are Carl von Clausewitz, Hans Morgenthau and Reinhold Niebuhr. Classical Realist thought has since been overshadowed by Neorealism after Kenneth Waltz' work became more widely accepted due to the rise of Structuralism in North American International Relations scholarship which favored the latter's emphasis on rationality rather than human nature as cause for political conflict.", 'title': 'Classical realism (international relations)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Vom Kriege (] ) is a book on war and military strategy by Prussian general Carl von Clausewitz (1780–1831), written mostly after the Napoleonic wars, between 1816 and 1830, and published posthumously by his wife Marie von Brühl in 1832. It has been translated into English several times as On War. "On War" is actually an unfinished work; Clausewitz had set about revising his accumulated manuscripts in 1827, but did not live to finish the task. His wife edited his collected works and published them between 1832 and 1835. His 10-volume collected works contain most of his larger historical and theoretical writings, though not his shorter articles and papers or his extensive correspondence with important political, military, intellectual and cultural leaders in the Prussian state. "On War" is formed by the first three volumes and represents his theoretical explorations. It is one of the most important treatises on political-military analysis and strategy ever written, and remains both controversial and an influence on strategic thinking.', 'title': 'On War'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "War from the Ground Up: Twenty-First Century Combat as Politics is a 2012 book on war and military strategy written by Emile Simpson, a former British Army officer. The book analyzes the War in Afghanistan (2001–present) in terms of Carl von Clausewitz's theory of war, arguing that modern counter-insurgencies have more in common with domestic political struggles than the traditional state-on-state conflicts described by Clausewitz. The book was favorably reviewed by Michael Howard, a prominent military historian, among others.", 'title': 'War from the Ground Up'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Battle of Wavre was the final major military action of the Hundred Days campaign and the Napoleonic Wars. It was fought on 18–19 June 1815 between the Prussian rearguard, consisting of the Prussian III Corps under the command of General Johann von Thielmann (whose chief-of-staff was Carl von Clausewitz) and three corps of the French army under the command of Marshal Grouchy. A blocking action, this battle kept 33,000 French soldiers from reaching the Battle of Waterloo and so helping in the defeat of Napoleon at Waterloo.', 'title': 'Battle of Wavre'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Panzer-Division "Clausewitz" was a German panzer division during World War II, named for Carl von Clausewitz.', 'title': 'Panzer Division Clausewitz'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'August Otto Rühle von Lilienstern, born 1780, died 1847. Prussian officer, joined Scharnhorst\'s Academy for Officers in the same class as Carl von Clausewitz. Later, they both taught at the Prussian General War School, which would become the Prussian War Academy, and Rühle became Clausewitz\' second successor as its director. Rühle published many articles, kept official war diaries, and wrote a two-volume "Manual for the Officer for Education in Peace and for Use in Action" ("Handbuch für den Offizier zur Belehrung im Frieden und zum Gebrauch im Felde"), published in Berlin in 1817 and 1818. Lilienstern and Clausewitz, teaching at the same school at the time of publication of this manual, were in agreement on many points. For example, they agreed that war was political in nature (which was neither a novel nor a controversial idea) and that war was a "Zweikampf." (That is, literally a "two-struggle," usually translated into English as "duel," though in fact the imagery and metaphor that Clausewitz pursued was a wrestling match.) Clausewitz made these ideas famous in his book On War. Their common views on such issues can be traced to the nature of the military intellectual community in Prussia and the common influence of Scharnhorst.', 'title': 'August Otto Rühle von Lilienstern'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Charles S. Roberts Awards Hall of Fame, formally known as the Clausewitz Award Hall of Fame, is named after legendary military writer Carl von Clausewitz. The recipients of this award have made an important contribution and left their mark on the contemporary hobby of military strategy games and simulations.', 'title': 'Charles Roberts Awards Hall of Fame'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Christopher Bassford (born 1953) is an American military historian, best known for his works on the Prussian military philosopher Carl von Clausewitz. Bassford graduated from the College of William and Mary with a degree in history and honors for his dissertation on tactical nuclear weapons and completed his MA in American diplomatic history at Ohio University. Subsequent to receiving his MA, he served five years on active duty as a U.S. Army field artillery officer, with tours in Korea and Germany. He completed a Ph.D. in modern European history at Purdue University and became director of studies in the theory and nature of war at the U.S. Marine Corps (USMC) Command and Staff College, then associate professor of National Policy Issues at the U.S. Army War College. He was Professor of Strategy at the National War College (NWC), in Washington, D.C., from 1999 until 2012, when he joined the faculty of the College of International Security Affairs (CISA) as part of the JSOMA program supporting U.S. Army Special Operations Command (USASOC). He is the webeditor of The Clausewitz Homepage, a large educational website that has been on-line since 1995.', 'title': 'Christopher Bassford'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The concept of absolute war was a theoretical construct developed by the Prussian military theorist General Carl von Clausewitz in his famous but unfinished philosophical exploration of war, "Vom Kriege" (in English, "On War", 1832). It is discussed only in the first half of Book VIII (there are only a couple of references to it elsewhere) and it does not appear in sections of the text written later. This indicates that it was an experiment that failed and was meant to be dropped.', 'title': 'Absolute war'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Orange County Water District (OCWD) is a California special district that manages the groundwater basin beneath central and northern Orange County, California. The groundwater basin provides a water supply to 19 municipal water agencies and special districts that serve more than 2.4 million Orange County residents. The Orange County Water District's service area covers approximately 350 square miles and the District owns approximately 1,600 acres in and near the Santa Ana River, which it uses to capture water flows for groundwater recharge. Additionally, OCWD owns approximately 2,150 acres of land above the Prado Dam in the Prado Reservoir and uses that land for water conservation, water storage and water quality improvements. OCWD's administrative offices and the Groundwater Replenishment System (GWRS) facilities are located in Fountain Valley, while OCWD operates various groundwater recharge facilities located in Anaheim and Orange.", 'title': 'Orange County Water District'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Paul Michael Teutul (born October 2, 1974) was one of the stars of the American reality television series "American Chopper". He co-founded Orange County Choppers (OCC) with his father, Paul Teutul Sr. in 1999. Teutul was the chief designer and fabricator of OCC. Prior to this, Teutul was head of the rail shop at Orange County Ironworks. He was also responsible for designing the logo for OCC. He is the owner of Paul Jr. Designs, which manufactures custom motorcycles and sells branded clothing.', 'title': 'Paul Teutul Jr.'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The Orange County Sanitation District (OCSD) is a wastewater treatment facility that serves Orange County, California. It consists of two operating plants, referred to as Plant No. 1 located in Fountain Valley and Plant No. 2 located in Huntington Beach. It is the third largest wastewater treatment facility west of the Mississippi River. OCSD and the Orange County Water District were awarded the Stockholm Industry Water Award in 2008 for pioneering work to develop with Trojan Technologies (Canada) the Groundwater Replenishment System, the world’s largest water purification plant for groundwater recharge. Orange County Sanitation District is commonly referred to as OCSD, though not to be confused with Orange County Sheriff's Department that shares the same acronym.", 'title': 'Orange County Sanitation District'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Mayor of Orange County, Florida is the Chief Executive Officer and Chairman of the Board of County Commissioners. The Mayor is elected countywide. Before the approval by voters of a 2004 charter amendment, the position of Mayor was called "Orange County Chairman", which became an elected position in 1990. The Orange County mayor’s post is the most powerful elected office in Central Florida. The current mayor of Orange County is Teresa Jacobs. Jacobs assumed office on January 4, 2011. The mayor is responsible for the day-to-day operations of the county government, overseeing over 7,000 employees with an annual budget of over $3 billion.', 'title': 'Mayor of Orange County, Florida'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Orange County Choppers (OCC) is a motorcycle manufacturer and lifestyle brand company based in the town of Newburgh, located in Orange County, New York, that was founded in 1999 by Paul Teutul Sr., and Paul Teutul Jr. The company was featured on "American Chopper", a reality TV show that debuted in September 2002 on the Discovery Channel. The series moved to Discovery Channel\'s sister channel TLC in 2007. Following cancellation of the Discovery series, the company was also featured on "Orange County Choppers" on the CMT network in 2013.', 'title': 'Orange County Choppers'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Troublesome Creek Ironworks, originally called Speedwell Furnace, is a historic iron furnace and archaeological site located near Monroeton, Rockingham County, North Carolina. The ironworks were established by 1770, and remained in operation into the early 20th century. After the Battle of Guilford Courthouse on March 15, 1781, General Nathanael Greene's troops camped at the ironworks to plan for a second attack by Cornwallis. George Washington visited the ironworks during his southern tour of 1791.", 'title': 'Troublesome Creek Ironworks'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Florida Department of Health in Orange County is the county health department in Orange County, Florida, formerly known as Orange County Health Department, charged with protecting the health and safety of visitors and residents of that county. The estimated daytime population of Orange County is 1.5 million people. Orange County has an estimated 55 million visitors per year including the major theme parks of Walt Disney World, Universal Orlando, and SeaWorld. The county seat is Orlando, Florida.', 'title': 'Orange County Health Department'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Leslie Segrete ( ; born February 28, 1975) is an American designer, seamstress, carpenter, and television personality. She is best known for her work on the TLC show "While You Were Out", which concluded a four-year run in 2006, She also appeared as a designer on "Trading Spaces" and "Ugliest House on the Block". She currently co-hosts "The Money Pit Home Improvement Radio Show" with Tom Kraeutler. In 2014, she joined the television show "Hotel Impossible" as a designer.', 'title': 'Leslie Segrete'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Orange County Line is a commuter rail line run by Metrolink from Los Angeles through Orange County to Oceanside in San Diego County, connecting with the Coaster commuter rail service to San Diego. The Orange County Line carries passengers to the primary Metrolink hub at Union Station in downtown Los Angeles, as well as to many attractions in Orange County including Angel Stadium of Anaheim and the Honda Center, the Disneyland Resort, Old Town Orange, and Mission San Juan Capistrano.', 'title': 'Orange County Line'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Orange County School of the Arts (OCSA), colloquially called "OH-sha", which is retained from a mispronunciation of the previous acronym for the previous name of the school (respectively "Orange County High School of the Arts" and "OCHSA"), is a 7th–12th grade public charter school located in downtown Santa Ana, Orange County, California, United States. The school caters to middle and high school students with talents in the performing, visual, literary arts, and culinary arts. The educational program prepares students for higher education institutions or employment in the professional arts industry. Both the academic and arts program have prompted recognition in the US News\' "Best High Schools" program. OCSA recently changed its school name from "Orange County High School of the Arts" (OCHSA) to "Orange County School of the Arts" to reflect the inclusion of middle school students.', 'title': 'Orange County School of the Arts'}]

