[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Devon Morris (born 1961-01-22) is a retired Jamaican sprinter who mainly competed in the 400 metres. He won this distance at the 1991 IAAF World Indoor Championships, and his personal best time was 45.49 seconds achieved during the 1987 World Championships. At the 1988 Summer Olympics he won a silver medal with the Jamaican team in 4 x 400 metres relay. He was an Earl Mellis Former Olympic Sprinter. Devon Morris is currently working as the Facility Director at Jubilee World.', 'title': 'Devon Morris'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Patrick Earl O'Connor (born 17 September 1966 in St. Catherine) is a retired Jamaican sprinter who specialized in the 400 metres. He won a bronze medal in 4 × 400 metres relay at the 1991 World Championships, together with teammates Seymour Fagan, Devon Morris and Winthrop Graham.", 'title': "Patrick O'Connor (athlete)"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Byron LaBeach (born 11 October 1930 in Kingston, Jamaica) is a retired Jamaican sprinter who competed in the 1952 Summer Olympics. He also won gold medals at the Central American and Caribbean Games with the Jamaican 4×100 metres relay and 4×400 metres relay teams. He is the brother of Panamanian sprinter Lloyd La Beach.', 'title': 'Byron LaBeach'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Juliet Jean Campbell (born 17 March 1970 in Kingston) is a retired Jamaican sprinter, who specialized in the 200 and 400 metres. She also competed on the successful Jamaican team in both 4 x 100 m and 4 x 400 m relay.', 'title': 'Juliet Campbell (athlete)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Richard "Torpedo" Thompson (born 7 June 1985) is a sprinter from Cascade, Trinidad and Tobago who specializes in the 100\xa0metres. He is the 9th best 100\xa0meters runner of all time and the Trinidad and Tobago record holder with a personal best of 9.82. He occasionally runs the 200\xa0meters and he has the second fastest time by a Trinidad and Tobago athlete and the 127th best of all-time from all countries in a best time of 20.18, 0.99 seconds slower than the World Record holder Usain Bolt.', 'title': 'Richard Thompson (sprinter)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Una Lorraine Morris (born January 17, 1947) is a retired Jamaican sprinter. She competed at the 1964, 1968 and 1972 Olympics in eight sprint events in total, with the best achievement of fourth place in the 200 metres in 1964. She won a bronze medal in the 4×100 metres relay at the 1967 Pan American Games. in 1963 and 1964 she was chosen as Jamaican Sportswoman of the Year.', 'title': 'Una Morris'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Usain St Leo Bolt ( ; born 21 August 1986) is a retired Jamaican sprinter. He is the first person to hold both the 100 metres and 200 metres world records since fully automatic time became mandatory. He also holds the world record as a part of the 4 × 100 metres relay. He is the reigning Olympic champion in these three events. Because of his dominance and achievements in sprint competition, he is widely considered to be the greatest sprinter of all time.', 'title': 'Usain Bolt'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Floyd Brown (born 8 September 1957) is a retired Jamaican sprinter.', 'title': 'Floyd Brown (athlete)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Michael Green (born 7 November 1970 in Trelawny) is a retired Jamaican sprinter who specialized in the 100 metres. Michael Green attended William Knibb Memorial High and graduated in May 1989 where he dominated the 100m. Green's nickname at William Knibb was 'Roach'. After graduating from William Knibb as the fastest male in 1989, Green was awarded a scholarship to attend Clemson University. Michael Green and 100m World Record setting sprinter Usain Bolt are former students at William Knibb Memorial High School.", 'title': 'Michael Green (sprinter)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Evon Clarke (born 2 March 1965) is a retired Jamaican sprinter.', 'title': 'Evon Clarke'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Hyakka Ryōran: Samurai Girls is a 2010 anime television series based on the light novels written by Akira Suzuki and illustrated by Niθ, published by Hobby Japan. Produced by ARMS, the series is directed by KOBUN; series composition by Ryunosuke Kingetsu; music by Tatsuya Kato; produced by Hisato Usui, Ryūji Sekine, Shinsaku Tanaka, and Takuro Hatakeyama; character designs by Tsutomu Miyazawa; with narration in early episodes provided by Fumihiko Tachiki. The series takes place in Great Japan, an alternate version of Japan where the Tokugawa shogunate remained active and has remained isolated from the rest of the world, and the story centers on Muneakira Yagyu, a young man attending Buou Academic School, an academy located at the base of Mount Fuji where elite nobles train to become samurai warriors. His life takes a sudden turn when he meets Jubei Yagyu, a mysterious girl who fell from the sky naked who later becomes his first "Master Samurai" after receiving a kiss from her.', 'title': 'List of Hyakka Ryōran Samurai Girls episodes'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Zionism in the Age of the Dictators is a 1983 work by American Trotskyist Lenni Brenner. The book makes the argument that Zionist leaders collaborated with Fascism, particularly in Nazi Germany, in order to build up a Jewish presence in Palestine. One edition of the book features on its cover a medal struck by Nazi Propaganda Minister Joseph Goebbels to commemorate a visit by Leopold von Mildenstein of the Nazi SS elite corps to Palestine as a guest of the Zionist Federation of Germany.', 'title': 'Zionism in the Age of the Dictators'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Tanaka Shinbei (田中 新兵衛 , 1832 – July 11, 1863) was one of the four members of the hitokiri, elite samurai, active in Japan during the late Tokugawa shogunate in the 1860s. The hitokiri including Shinbei were working under the command of Takechi Hanpeita, the leader of the Loyalists of Tosa, who sought to overthrow the Tokugawa shogunate and restore the Emperor of Japan to power.', 'title': 'Tanaka Shinbei'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Sipahi (Ottoman Turkish: سپاهی "sipâhi"\u200e , ] ) were two types of Ottoman cavalry corps, including the fief-holding provincial "timarli sipahi", which constituted most of the army, and the regular "kapikulu sipahi", palace troops. Other types of cavalry which were not regarded "sipahi" were the irregular "akıncı" ("raiders"). The "sipahi" formed their own distinctive social classes, and were notably in rivalry with the Janissaries, the elite corps of the Sultan.', 'title': 'Sipahi'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Bakumatsu (幕末 , bakumatsu , "the end ("matsu") of the military government ("baku", short for "bakufu" "tent-government")) refers to the final years of the Edo period when the Tokugawa shogunate ended. Between 1853 and 1867 Japan ended its isolationist foreign policy known as "sakoku" and changed from a feudal Tokugawa shogunate to the pre-modern empire of the Meiji government. The major ideological-political divide during this period was between the pro-imperial nationalists called "ishin shishi" and the shogunate forces, which included the elite shinsengumi swordsmen.', 'title': 'Bakumatsu'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Corps Austria is a member Corps of the Kösener Senioren-Convents-Verband, the association of the oldest student fraternities in Germany, Austria and Switzerland. Corps Austria is "pflichtschlagend", which refers to the fact that it requires of its members to participate in several organized duel-like fencing engagements with members of other specific student fraternities, a ritual dating back to the 17th century and described by Mark Twain in his book "A tramp abroad". The Corps Austria is further considered "farbentragend" in that its members wear a colored sash (right shoulder to left waist) across their chests as evidence of their membership of the fraternity. Both of these tendencies are characteristic of the most traditional and often very elite all-male fraternities in countries for central Europe. Eligible applicants are students of the Goethe University Frankfurt and other colleges in Frankfurt, Germany. Members of Corps Austria are colloquially referred to as "Austrianer", or simply "Austern". Corps Austria was founded in 1861 at the Charles-Ferdinand University in Prague and moved to the newly established Goethe University Frankfurt in 1919.', 'title': 'Corps Austria Frankfurt am Main'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The 45th Rattray's Sikhs was an infantry regiment of the British Indian Army. They could trace their origins to the 1st Bengal Military Police Battalion raised in April 1856, at Lahore, by Captain Thomas Rattray originally consisting of a troop of 100 cavalry and 500 infantry. The initial class composition of the troops was 50% Sikhs and 50% Dogras, Rajputs and Mussulmans (Muslims) from the Punjab and the North-West Frontier. It is said that he went through the villages challenging men to wrestle with him on the condition that they had to join up. Whatever the case, the regiment was raised and trained and developed as an elite corps, which soon saw action in Bihar (then part of Eastern Bengal) in the Sonthal 'purghanas'. After sterling service in Bihar, Bengal and Assam, and during the 1857 Mutiny, the cavalry portion was eventually disbanded in 1864 and the infantry section was taken into the line of Bengal Native Infantry as the '45th (Rattray's Sikh) Native Regiment of Infantry'.", 'title': "45th Rattray's Sikhs"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Russian Imperial Guard, officially known as the Leib Guard (Russian: Лейб-гвардия "leyb-gvardiya", from German "Leib" "Body"; cf. Life Guards / Bodyguard) were military units serving as personal guards of the Emperor of Russia. Peter the Great founded the first such units following the Prussian practice in the 1690s, to replace the politically motivated Streltsy. The Imperial Guard subsequently increased in size and diversity to become an elite corps of all branches within the Imperial Army rather than Household troops in direct attendance on the Tsar. Numerous links were however maintained with the Imperial family and the bulk of the regiments of the Imperial Guard were stationed in and around Saint Petersburg in peacetime.', 'title': 'Imperial Guard (Russia)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Fifth Regiment (Spanish: "Quinto Regimiento" , full name "Quinto Regimiento de Milicias Populares"), was an elite corps loyal to the Spanish Republic at the onset of the Spanish Civil War. Made up of volunteers, the Fifth Regiment was active in the first critical phase of the war and became one of the most renowned units loyal to the Republic.', 'title': 'Fifth Regiment'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The Shōgitai (彰義隊, lit. "League to Demonstrate Righteousness") was an elite corps of the Shogunate during the Bakumatsu period in Japan. The Shōgitai took a large part in the battles of the Boshin war, especially at the Battle of Toba-Fushimi, and the Battle of Ueno, where they were nearly exterminated.', 'title': 'Shōgitai'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Battle of Fallen Timbers (August 20, 1794) was the final battle of the Northwest Indian War, a struggle between Native American tribes affiliated with the Western Confederacy, including support from the British led by Captain Alexander McKillop, against the United States for control of the Northwest Territory (an area north of the Ohio River, east of the Mississippi River, and southwest of the Great Lakes). This land had been ceded to the United States in accordance with the Treaty of Paris (1783), but the Native Americans (who had not been party to the treaty) refused to comply with the treaty and relinquish control. British army bases were maintained there to support their Native allies. This ultimately led to the American offensive and subsequent British-Indian withdrawal from the territory altogether following the Treaty of Greenville. The battle, which was a decisive victory for the United States, ended major hostilities in the region until Tecumseh's War and the Battle of Tippecanoe in 1811.", 'title': 'Battle of Fallen Timbers'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Kasi (Pashto: کاسي\u200e ) or Kansi (Pashto: کانسي\u200e ) are a Pashtun supertribe son of Kharshbun son of Sarban tribal confederacy, primarily found in Pakistan, and Afghanistan. A large part of the Kasi tribe live in the city of Quetta Balochistan, and Pakistan. Another large part of the Kasi confederacy is known as Shinwari, mainly settled in the eastern valleys of Nangarhar Province, Afghanistan and around Landi Kotal in the Federally Administered Tribal Areas, and Kohat District Khyber Pakhtunkhwa Pakistan.', 'title': 'Kasi (Pashtun tribe)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Prophetstown State Park, named after Tenskwatawa ("The Prophet"), a religious leader and younger brother of Shawnee leader Tecumseh, is located near the town of Battle Ground, Indiana, United States, about a mile east of the site of the Battle of Tippecanoe. Established in 2004, it is Indiana’s newest state park. The park is home to the Museum at Prophetstown, which recreates a Native American village and a 1920s-era farm.', 'title': 'Prophetstown State Park'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The following units of the U.S. Army and state militia forces under Indiana Governor William Henry Harrison, fought against the Native American warriors of Tecumseh\'s Confederacy, led by Chief Tecumseh\'s brother, Tenskwatawa "The Prophet" at the battle of Tippecanoe on November 7, 1811.', 'title': 'Tippecanoe order of battle'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Native American Shawnee warrior and chief, who became the primary leader of a large, multi-tribal confederacy in the early years of the nineteenth century. Born in the Ohio Country (present-day Ohio), and growing up during the American Revolutionary War and the Northwest Indian War, Tecumseh was exposed to warfare and envisioned the establishment of an independent Indian nation east of the Mississippi River under British protection and worked to recruit additional members to his tribal confederacy from the southern United States.', 'title': 'Tecumseh'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Tecumseh's Confederacy was a group of Native Americans in the Old Northwest that began to form in the early 19th century around the teaching of Tenskwatawa (The Prophet). The confederation grew over several years and came to include several thousand warriors. Shawnee leader Tecumseh, the brother of The Prophet, developed into the leader of the group as early as 1808. Deemed a threat to the United States, a preemptive strike against the confederation was launched resulting in the 1811 Battle of Tippecanoe. Under Tecumseh's leadership, the confederation went to war with the United States during Tecumseh's War and the War of 1812. Following the death of Tecumseh in 1813 the confederation fell apart.", 'title': "Tecumseh's Confederacy"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Battle of Tippecanoe ( ) was fought on November 7, 1811, in what is now Battle Ground, Indiana, between American forces led by Governor William Henry Harrison of the Indiana Territory and Native American warriors associated with the Shawnee leader Tecumseh. Tecumseh and his brother Tenskwatawa (commonly known as "The Prophet") were leaders of a confederacy of Native Americans from various tribes that opposed US expansion into Native territory. As tensions and violence increased, Governor Harrison marched with an army of about 1,000 men to disperse the confederacy\'s headquarters at Prophetstown, near the confluence of the Tippecanoe and Wabash Rivers.', 'title': 'Battle of Tippecanoe'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Tenskwatawa (also called Tenskatawa, Tenskwatawah, Tensquatawa or Lalawethika) (January 1775\xa0– November 1836) was a Native American religious and political leader of the Shawnee tribe, known as the Prophet or the Shawnee Prophet. He was a younger brother of Tecumseh, leader of the Shawnee. In his early years Tenskwatawa was given the name Lalawethika ("He Makes a Loud Noise" or "The Noise Maker"), but he changed it around 1805 and transformed himself from a hapless, alcoholic youth into an influential spiritual leader. Tenskwatawa denounced the Americans, calling them the offspring of the Evil Spirit, and lead a purification movement that promoted unity among the American Indians, rejected acculturation to the American way of life, and encouraged his followers to pursue traditional ways.', 'title': 'Tenskwatawa'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Ziri ibn Atiyya (Berber language: Ziri n Ɛaṭiyya Ameɣraw) also known as Ziri ibn Atiyya ibn Abd Allah ibn Tabādalt ibn Muhammad ibn Khazar az-Zanātī al-Maghrāwī al-Khazarī (died 1001) was the first tribal leader of the Berber Maghrawa tribal confederacy and kingdom.', 'title': 'Ziri ibn Atiyya'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Ẓafār or Dhafar (Ar ظفار) "Ðafār " (museum: UTM: 435700E, 1571160 N zone 38P, 14°12\'N, 44°24\'E, deviating slightly from Google Earth) is an ancient Himyarite site situated in Yemen, some 130\xa0km south-south-east of today\'s capital, Sana\'a. Given mention in several ancient texts, there is little doubt about the pronunciation of the name. Despite the opinion of local patriots in Oman, this site in the Yemen is far older than its namesake there. It lies in the Yemenite highlands at some 2800 m. The closest large town is Yarim, which is 10\xa0km directly to the north-north-west. Zafar was the capital of the Himyarites (110 BCE - 525 CE), which at its peak ruled most of the Arabia. The Himyar are not a tribe, but rather a tribal confederacy. For 250 years the confederacy and its allies combined territory extended past Riyadh to the north and the Euphrates to the north-east. Zafar was the Himyarite capital in Southern Arabia prior to the Aksumite conquest.', 'title': 'Zafar, Yemen'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Five Style (a name taken from a martial arts technique called "Five Style Fist"), also known as 5ive Style, is a Chicago-based funk/jam quartet. Their albums were released on the Subpop label in the 1990s. The group existed from about 1993-2000 in various incarnations, centered on the guitar work of Billy Dolan (who has also played in Heroic Doses, and The Fire Theft which featured 3 members of Sunny Day Real Estate, among other projects). Other members were major players of the 1990s Chicago music scene and included bassist Leroy Bach (of Chicago funk group Uptighty, the first Liz Phair studio band, and Wilco fame), drummer John Herndon (aka "Johnny Machine", who made his first appearances on record in "Tool of the Man" era Poster Children and became established as a longstanding drummer/percussionist in Tortoise), and keyboardist Jeremy Jacobsen (also known as The Lonesome Organist and member of Euphone). Drummer Ryan Rapsys, also of Euphone and Gauge, filled in on drums on a January 2000 tour when they opened for Giant Sand and Vic Chesnutt. 5ive Style were the opening act in a brief May 1996 tour which also included The Sea and Cake and Tortoise; by some accounts these dates were the best shows of the Chicago "post-rock" hey day.', 'title': 'Five Style'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Deathray (1998–2007) was a band from Sacramento, California, formed by former Cake members Greg Brown and Victor Damiani, and Dana Gumbiner, a musician formerly of the Sacramento indie band Little Guilt Shrine.', 'title': 'Deathray'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Chelsea Nikkel, better known by her stage name Princess Chelsea, is an experimental producer and musician from Auckland, New Zealand, and a previous member of twee pop band The Brunettes and Auckland band Teenwolf. Nikkel is associated with the Lil' Chief Records collective and is a part-time member of Auckland soul group The Cosbys and Disciples of Macca, a Paul McCartney covers band featuring members of The Brunettes, Ruby Suns, Bressa Creeting Cake and Lawrence Arabia and more recently performs as bass player in three piece rock n roll band 'Hang Loose'. Nikkel works in Auckland as a composer.", 'title': 'Princess Chelsea'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Trip Shakespeare was an American rock band formed in Minneapolis, Minnesota in the late 1980s/early 1990s. The band included Dan Wilson and John Munson, who would later go on to be founding members of Semisonic.', 'title': 'Trip Shakespeare'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'New York Cake is a 1981 Italo disco album by Italian band Kano, recorded for Full Time Records and released in the United States under Mirage label. It has been produced by its members, namely Luciano Ninzatti, Matteo Bonsanto, Stefano Pulga. The album features Italian Top 3 hit "Baby Not Tonight" and American #89 Hit "Can\'t Hold Back (Your Loving)".', 'title': 'New York Cake'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Slice The Cake was an international Progressive Deathcore group spanning from Australia, England, and Sweden. Formed in 2009, the trio consisted of vocalist Gareth Mason, instrumentalist Jonas Johansson, and composer Jack "Magero" Richardson. Although the band members are all from different countries, they have played a couple shows with stand-ins. They released one EP and 3 full length albums before they disbanded. Their albums have been released to critical acclaim. <br>', 'title': 'Slice The Cake'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Semisonic is an American rock band formed in Minneapolis, Minnesota in 1995. The band had three members: Dan Wilson (lead vocals, guitar, keyboards), John Munson (bass guitar, backing vocals, keyboards, guitar), and Jacob Slichter (drums, percussion, keyboards). They are best known for their 1998 single "Closing Time".', 'title': 'Semisonic'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Cake Like was an all-female indie rock band based in New York City. Its members were bassist and lead singer Kerri Kenney, drummer Jody Seifert, and vocalist and guitarist Nina Hellman. The band came together in 1993 when Kenney and Hellman met at New York University's Experimental Theater Wing, decided to form a band, and were joined by Hellman's roommate Seifert. The members had never played music before and so developed their own unique style. Their songs often play out like poetry set to erratic guitar-rock. They soon attracted the attention of John Zorn, who signed the band to his Avant Records label, which released their first LP. Ric Ocasek, formerly of The Cars, produced their follow-up EP. Subsequently, Neil Young signed the band to his Vapor Records label, which released their second and third LPs.", 'title': 'Cake Like'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Cake (stylized CAKE) is an American alternative rock band from Sacramento, California. Consisting of singer John McCrea, trumpeter Vince DiFiore, guitarist Xan McCurdy, bassist Gabe Nelson and drummer Paulo Baldi, the band has been noted for McCrea's sarcastic lyrics and monotone vocals, DiFiore's trumpet parts, and their wide-ranging musical influences, including country music, Mariachi, rock, funk, Iranian folk music and hip hop.", 'title': 'Cake (band)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Paul Edward Postma (born February 22, 1989) is a Canadian professional ice hockey defenceman currently playing for the Boston Bruins of the National Hockey League (NHL). He was drafted 205th overall in the 2007 NHL Entry Draft by the Atlanta Thrashers. During his major junior career with the Swift Current Broncos and Calgary Hitmen of the Western Hockey League (WHL) Postma won the WHL Plus-Minus Award and was a WHL East First Team All-Star in 2009.', 'title': 'Paul Postma'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Andrei Vyacheslavovich Loktionov (Russian: Андре́й Вячесла́вович Локтио́нов ; born 30 May 1990) is a Russian professional ice hockey player currently playing on a try-out basis with the Los Angeles Kings of the National Hockey League (NHL). Drafted by the Kings in the fifth round, 128th overall, at the 2008 NHL Entry Draft, Loktionov has also previously played in the National Hockey League (NHL) within the New Jersey Devils organization and the Carolina Hurricanes.', 'title': 'Andrei Loktionov'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The NHL Plus-Minus Award was a trophy awarded annually by the National Hockey League to the ice hockey "player, having played a minimum of 60 games, who leads the league in plus-minus statistics." It was sponsored by a commercial business, and it had been known under five different names. First given for performance in the  season, Wayne Gretzky won the award the most times, three, and also led the League once prior to the inception of the Award. Bobby Orr has led the League the most times in plus-minus, with six, all prior to the inception of the Award. The Award was discontinued after being awarded to Pavel Datsyuk following the  season.', 'title': 'NHL Plus-Minus Award'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Pavel Valerievich Datsyuk (Russian: Па́вел Вале́рьевич Дацю́к , ] ; born 20 July 1978) also known as The Magic Man is a Russian professional ice hockey player and captain for SKA Saint Petersburg of the Kontinental Hockey League (KHL). His NHL rights are currently being held by the Arizona Coyotes. He previously played for the Detroit Red Wings of the National Hockey League (NHL) from 2001 to 2016 before retiring from the NHL. On January 27, 2017, in a ceremony during the All-Star Weekend in Los Angeles, Datsyuk became part of the second group of players to be named one of the '100 Greatest NHL Players' in history, and was the only active player outside of the NHL at the time of announcement.", 'title': 'Pavel Datsyuk'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Lars Niklas Sundström (born June 6, 1975) is a former professional ice hockey player who started his professional career in Modo Hockey. He was drafted eighth overall in the 1993 NHL Entry Draft by the New York Rangers. He was also on Wayne Gretzky's line. He was not known for his goal scoring ability, but for his defensive play. He was traded to the San Jose Sharks in 1999, and to the Montreal Canadiens in 2003. Sundström plays forward and specializes in defensive roles. When he was a junior player he formed a line in Modo with future NHL stars Peter Forsberg and Markus Näslund. He wore the number 24 for the San Jose Sharks and the New York Rangers but wore the number 37 for the Montreal Canadiens. After 11 NHL seasons, he returned to play in Sweden at the start of the 2006–07 season, leading Modo to a surprise title during his first season, scoring several vital goals in the playoffs. He formed an effective partnership with Norwegian Per-Åge Skrøder, leading to Skrøder winning the top scorer rankings in 2009. Modo still missed the playoffs that year, despite Sundström having the best plus-minus rating in the entire series. On December 3, 2013, Sundström officially announced his retirement.", 'title': 'Niklas Sundström'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Mikhail Yunkov (Russian: Михаил Юньков ; born February 16, 1986 in Voskresensk, USSR) is a Russian professional ice hockey forward who is currently playing for Avangard Omsk in the Kontinental Hockey League (KHL). In the 2004 NHL Entry Draft, Mikhail was drafted 62nd overall in the 2nd round by the Washington Capitals. He is the brother of Alexander Yunkov, who is also a professional ice hockey player.', 'title': 'Mikhail Yunkov'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Ruslan Bashkirov (born March 7, 1989) is a Russian professional ice hockey player. Bashkirov is currently a member of Amur Khabarovsk of the Russian KHL. On June 23, 2007, he was drafted in the second round, 60th overall, by the Ottawa Senators in the 2007 NHL Entry Draft held in Columbus, Ohio. He is 6\'0" tall and weighs 184 pounds. He plays as a forward, and shoots left. He is the twin brother of ice hockey player Roman Bashkirov.', 'title': 'Ruslan Bashkirov'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Byron Brad McCrimmon (March 29, 1959 – September 7, 2011) was a Canadian professional ice hockey defenceman and coach. He played over 1,200 games in the National Hockey League (NHL) for the Boston Bruins, Philadelphia Flyers, Calgary Flames, Detroit Red Wings, Hartford Whalers and Phoenix Coyotes between 1979 and 1997. He achieved his greatest success in Calgary, where he was named a second team All-Star in 1987–88, played in the 1988 NHL All-Star Game and won the Plus-Minus Award with a league leading total of +48. In 1989, he helped the Flames win their first Stanley Cup championship. His career plus-minus of +444 is one of the highest totals in NHL history.', 'title': 'Brad McCrimmon'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Brian Desmond "Smitty" Smith (September 6, 1940 – August 2, 1995) was a Canadian professional hockey player and sportscaster. Smith was born in Ottawa, Ontario, the son of former professional ice hockey player Des Smith and brother of former professional hockey goaltender Gary Smith. Smith was a professional ice hockey player from 1960 to 1973, playing in the National Hockey League (NHL) with the Los Angeles Kings and Minnesota North Stars. Following his hockey career, Smith was a broadcaster for CJOH-TV in Ottawa until 1995, when he was shot and killed by gunman Jeffrey Arenburg.', 'title': 'Brian Smith (ice hockey, born 1940)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Mikael Lindholm (born 19 December 1964 in Gävle, Sweden) is a former professional ice hockey player who played for the Los Angeles Kings in the National Hockey League. His son Elias Lindholm is a professional ice hockey player and was selected by the Carolina Hurricanes in the 1st round (5th overall) of the 2013 NHL Entry Draft. . Mikael is the father of the NHL hockey player, Elias Lindholm and the uncle of Calle Järnkrok.', 'title': 'Mikael Lindholm'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Iraultza (Basque for Revolution) was a small Basque militant armed group of leftist tendency. Seven of the group would die preparing explosive devices. On June 27, 1986, a bomb claimed by Iraultza mangled a young worker called José Miguel Moros Peña in Portugalete. The victim would die in Cruces Hospital (Barakaldo) on August 13, 1986. The group is also known for being described by the United States Government as "probably [having] committed more bombings against American business interests than any other European terrorist group". Soon after, the group, which had been active for about a decade with small attacks of explosives that never aimed to cause any personal injuries, announced its dissolution. When the group was operational, it is estimated that it had approximately 20 members.', 'title': 'Iraultza'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Battle of Qala-i-Jangi (also incorrectly referred to as the "Battle of Mazar-i-Sharif") was a prisoner-of-war camp uprising that took place between November 25 and December 1, 2001, in northern Afghanistan, following the armed intervention by United States-led coalition forces to try to overthrow the Taliban\'s Islamic Emirate of Afghanistan, which it had accused of harboring al-Qaeda operatives.', 'title': 'Battle of Qala-i-Jangi'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Filiberto Ojeda Ríos (April 26, 1933 – September 23, 2005) was the commander-in-chief ("Responsable General") of the Boricua Popular Army ("Ejército Popular Boricua, a.k.a., Los Macheteros"). According to an unsigned article in the "Los Angeles Times", Los Macheteros was “a terrorist group seeking Puerto Rico\'s independence.” The group campaigned for, and supported, the independence of Puerto Rico from the United States. In 2001, FBI Director Louis J. Freeh claimed the group was linked to acts of terrorism, but Ronald Fernandez, scholar of Puerto Rican history, suggests such labeling was an act of political convenience by the United States Government, intended to "shift the blame for any attacks on U.S. policy or personnel from us to them". Ríos was also a founder of the FALN. In a 1983 New York Times article, Robert McFadden described the FALN as a Puerto Rican terrorist organization responsible for bombings during the 1970s and early 1980s "in the name of Puerto Rican independence".', 'title': 'Filiberto Ojeda Ríos'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Mark E. Mitchell is the current Acting Assistant Secretary of Defense for Special Operations and Low-Intensity Conflict of the United States Department of Defense. A retired Colonel, Mitchell was the first member of the United States Army to be awarded the Distinguished Service Cross during the War in Afghanistan and was the first to receive the award since the Vietnam War. In 2003, he received the award for his actions during the Battle of Qala-i-Jangi, which took place in late November – early December 2001.', 'title': 'Mark E. Mitchell'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Mark E. Curry (born February 13, 1968) is an American financial technology entrepreneur and philanthropist. Curry is the founder of SOL Partners, Reform Online Lending, Executive Pride and the Mark E. Curry Family Foundation. In December 2016, Curry acquired the Puerto Rican newspaper NotiCel. Curry is a native of Tonganoxie, Kansas and currently resides in San Juan, Puerto Rico.', 'title': 'Mark E. Curry'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Syed Mohammed Yusuf Shah, popularly known as Syed Salahudeen, is the head of Hizb-ul-Mujahideen, a terrorist group operating in Kashmir, and head of an alliance of anti-India militant groups, the United Jihad Council, that works to annex the Indian state of Jammu and Kashmir to Pakistan . Salahuddin vowed to block any peaceful resolution to the Kashmir conflict, threatened to train more Kashmiri suicide bombers, and vowed to turn the Kashmir valley “into a graveyard for Indian forces.” He is listed on the NIA Most Wanted list. On 26 June 2017, he was named as a Specially Designated Global Terrorist by the US Department Of State. After being designated as a Global terrorist, he addressed the Pakistani Media at Muzaffarabad’s Centre Press Club, claiming that "The declaration was a joint move by the US, Israel, and India to express their animosity towards Pakistan."', 'title': 'Sayeed Salahudeen'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Combat Terrorist Organization or Autonomous Combat Terrorist Organization (rus. Боевая Террористическая Организация) was a Russian radical Neo-Nazi terrorist group based in Saint Petersburg from 9 August 2003 to 2006. It was formed by two members of the "Mad Crowd" skinhead organization, Dmitriy Borovikov and Voevodin Alexey.', 'title': 'Combat Terrorist Organization'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Giuseppe Valerio "Giusva" Fioravanti (born 28 March 1958) is an Italian who, with Francesca Mambro, was a leading figure in a far right terrorist group "Nuclei Armati Rivoluzionari" ("Armed Revolutionary Nuclei" or NAR). Fioravanti appeared in films and television from a young age, and in his early teens was the most famous child in Italy. He and Mambro were fugitives wanted for terrorist offences by their early twenties, they spent a further period on the run while wanted for the Bologna bombing. Both were captured after gunfights with police. Although Fioravanti, Mambro and a third NAR mamber were convicted of the bombing, there were those who thought that a higher level of the conspiracy was never uncovered. Fioravanti and Mambro admit carrying out terrorist murders, but have always denied any involvement in the Bologna station bomb.', 'title': 'Valerio Fioravanti'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Soldiers of Egypt (Ajnad Misr in Arabic) is an active Salafist Islamist militant group that has been operating near Cairo, Egypt. The groups was founded by Humam Muhammed in 2013, after he split away from the Ansar Bait al-Maqdis militant group. The group claims that its attacks are "retribution" for the August 2013 Rabaa Massacre; notably, the group targets only security forces. It has warned civilians of the presence of bombs that it has placed. The Cairo Court for Urgent Matters declared the group a terrorist group on 22 May 2014. It has been a Proscribed Organisation in the United Kingdom under the Terrorism Act 2000 since November 2014. The United States Department of State designated it a terrorist organization on 18 December 2014.', 'title': 'Soldiers of Egypt'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Patricia Campbell "Patty" Hearst (born February 20, 1954), now known as Patricia Hearst Shaw, is the granddaughter of American publishing magnate William Randolph Hearst. She became nationally known for events following her 1974 kidnapping while she was a 19-year-old student living in Berkeley, California. Hearst was abducted by a small left-wing terrorist group with only 20 members known as the Symbionese Liberation Army. After being isolated and threatened with death, she became supportive of their cause, making propaganda announcements for them and taking part in illegal activities.', 'title': 'Patty Hearst'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Bunte Blätter, Op. 99, is a collection of piano pieces by Robert Schumann, assembled from earlier unpublished pieces after the success of the "Album for the Young".', 'title': 'Bunte Blätter'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Robert Schumann (8\xa0June 181029\xa0July 1856) was a German composer and influential music critic. He is widely regarded as one of the greatest composers of the Romantic era. Schumann left the study of law, intending to pursue a career as a virtuoso pianist. He had been assured by his teacher Friedrich Wieck that he could become the finest pianist in Europe, but a hand injury ended this dream. Schumann then focused his musical energies on composing.', 'title': 'Robert Schumann'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Georg Joseph Vogler, also known as Abbé Vogler (June 15, 1749 – May 6, 1814), was a German composer, organist, teacher and theorist. In a long and colorful career extending over many more nations and decades than was usual at the time, Vogler established himself as a foremost experimenter in baroque and early classic music. His greatest successes came as performer and designer for the organ at various courts and cities around Europe, as well as a teacher, attracting highly successful and devoted pupils such as Carl Maria von Weber. His career as a music theorist and composer however was mixed, with contemporaries such as Mozart believing Vogler to have been a charlatan. Despite his mixed reception in his own life, his highly-original contributions in many areas of music (particularly musicology and organ theory) and influence on his pupils endured, and combined with his eccentric and adventurous career, prompted one historian to summarize Vogler as "one of the most bizarre characters in the history of music".', 'title': 'Georg Joseph Vogler'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Étienne-Joseph Floquet (23 November 174810 May 1785) was a French composer, mainly of operas. He was born in Aix-en-Provence and began his career by writing church music, before moving to Paris in 1767. There, Floquet made a name for himself with the requiem he wrote for the funeral of the composer Jean-Joseph de Mondonville in 1772. Floquet\'s first work for the Paris Opéra, the "ballet héroïque" "L\'union de l\'amour et les arts," was a triumph, enjoying 60 performances between its premiere in September 1773 and January 1774. The audience at the premiere was so enthusiastic that the performance had to be stopped several times because of the applause and, at the final curtain, Floquet was presented on stage, the first composer in the history of the Paris Opéra to enjoy such an honour. However, the arrival of the German composer Christoph Willibald Gluck in Paris later that year changed French musical taste and Floquet\'s style became unfashionable. After the failure of his next opera, "Azolan", Floquet decided to travel to Italy to perfect his musical education. There he studied composition under Nicola Sala in Naples and counterpoint under Padre Martini in Bologna, where he turned momentarily back to church music composing a "Te deum".', 'title': 'Étienne-Joseph Floquet'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Johann Valentin Meder (baptised May 3, 1649 – July 1719) was a German composer, organist, and singer. (He is not to be confused with the German composer Johann Gabriel Meder, born in 1755 in Erfurt, and active in Amsterdam until 1800; nor is there evidence that the two men were related.)', 'title': 'Johann Valentin Meder'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Cassiber were a German avant-rock group founded in 1982 by German composer and saxophonist Alfred Harth, German composer, music-theatre director and keyboardist Heiner Goebbels, English drummer Chris Cutler from Henry Cow and German guitarist Christoph Anders. They recorded five albums, toured extensively across Europe, Asia and North America, and disbanded in 1992.', 'title': 'Cassiber'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Heinrich Schütz (] ; 18 October\xa0[O.S. 8 October]\xa01585 – 6 November 1672) was a German composer and organist, generally regarded as the most important German composer before Johann Sebastian Bach and often considered to be one of the most important composers of the 17th century. He wrote what is traditionally considered to be the first German opera, "Dafne", performed at Torgau in 1627, the music of which has since been lost.', 'title': 'Heinrich Schütz'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'József Ács (born 1948) is a German composer, and classical pianist and composer of Hungarian origin. A graduate of the Franz Liszt Academy of Music in Budapest and the Robert Schumann Hochschule in Düsseldorf, he won the first prize for piano at the "German Music Competition" in the Beethovenhalle in Bonn. He is particularly renowned for his recitals of Franz Liszt, and has done work in conjunction with the Vatican Archives. More recently he has been performing the works of Italian composer Ruggero Leoncavallo. He composed a completion of Leoncavallo\'s Requiem which was a fragment. Ács also wrote a small mass for choir and organ called, "Weihnachtslieder-Messe." Appropriate for the Christmas season, this joyful mass incorporates two Christmas tunes, In dulci jubilo, and Es kommt ein Schiff geladen.', 'title': 'József Ács (musician)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Duo Goebbels/Harth (1975–1988), combining German composer, music-theatre director and keyboardist Heiner Goebbels and German composer, multi-media artist and saxophonist Alfred 23 Harth became famous for its adaptation of and departure from European composers, especially Hanns Eisler, implemented in a provocatively fresh manner into structured free improvisations and deploying content from areas beyond music. The duo was nicknamed the “Eisler brothers” by music critic W.Liefland. They later also experimented with different genres and sound collages, including electronic devices. The duo played in many international festivals and concerts in cities as diverse as Tel Aviv, Zagreb, West and East Berlin and South America.', 'title': 'Duo Goebbels/Harth'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Carl Heinrich Graun (7 May 1704 – 8 August 1759) was a German composer and tenor singer. Along with Johann Adolph Hasse, he is considered to be the most important German composer of Italian opera of his time.', 'title': 'Carl Heinrich Graun'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Jean-Louis Xavier Trintignant (] ; born 11 December 1930) is a French actor, screenwriter and director who has enjoyed international acclaim. He won the Best Actor Award at the 1969 Cannes Film Festival as well as the Best Actor Award at the César Awards 2013.', 'title': 'Jean-Louis Trintignant'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Frederick George Peter Ingle Finch (28 September 191614 January 1977) was an English-born Australian actor. He is best remembered for his role as "crazed" television anchorman Howard Beale in the film "Network", which earned him a posthumous Academy Award for Best Actor, his fifth Best Actor award from the British Academy of Film and Television Arts, and a Best Actor award from the Golden Globes. He was the first of two persons to win a posthumous Academy Award in an acting category, and coincidentally also the first of the two Australian actors to have done so, the other being Heath Ledger.', 'title': 'Peter Finch'}
