 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The National Football League (NFL) regular season begins the weekend after Labor Day in early September and ends in December or early January. It consists of 256 games, where each team (32 total) plays 16 games during a 17-week period. Since 2012, the NFL schedule generally has games in one of five time slots during the week. A game played on Thursday night, kicking off at 8:25 PM (ET). The majority of games are played on Sunday, most kicking off at 1:00 PM (ET), some late afternoon games starting at 4:05 or 4:25 PM (ET). Additionally, one Sunday night game is played every week at 8:30 PM (ET). One Monday night game then starts at 8:30 PM (ET) every week with the exception of the first week of the regular season, in which two Monday night games are played back-to-back (the second game always occurring on the West coast), as well as the last week of the season, in which no Monday night game is held. In addition to these regularly scheduled games, there are occasionally games at other times, such as a Saturday afternoon or evening, or the annual Thanksgiving Day games in which three games are played. During the final week of the regular season, all games are held on Sunday.', 'title': 'NFL regular season'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Avtaar is a 1983 film starring Rajesh Khanna and Shabana Azmi. It was directed by Mohan Kumar, and the music was by Laxmikant Pyarelal. Rajesh Khanna did achieve success from "Amardeep" and "Prem Bandhan" onwards, but this was Rajesh Khanna\'s biggest hit film in terms of box office collections after his bad phase from 1976 to 1978. Avtaar was a commercial hit, and was critically acclaimed. It also earned several Filmfare nominations. However Rajesh Khanna missed the Best Actor award to Naseeruddin Shah for Masoom. In 1986 Mohan Kumar made Amrit with Rajesh Khanna in the lead as an old man but with different story line. Rajesh Khanna bagged All-India Critics Association (AICA) Best Actor Award for his performance in this film for the year 1983.', 'title': 'Avtaar'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Caleb "Cal" Knight is a fictional character from the BBC medical drama "Casualty", played by actor Richard Winsor. He first appeared in the series twenty-eight episode "Brothers at Arms", broadcast on 18 January 2014. Winsor had previously auditioned for a role in "Casualty\'s" spin-off show "Holby City". Producers were impressed and recalled him to read for the part of Cal. Winsor\'s casting was announced alongside George Rainsford who was hired to play Cal\'s brother Ethan Hardy. The pair had to pass a screen test together as producers were looking for a strong sibling chemistry. Cal\'s role in the show is a Specialist registrar in emergency medicine. He was originally introduced as a locum. The medic is played as a lothario and womaniser type character. He can manipulate those around him with charm to better his career. Writers gave Cal a backstory detailing the difficult relationship with his father and brother. Despite having the same parents Cal and Ethan had different upbringings, which sets up a sibling rivalry. Their relationship has been important in the development of both characters. Executive producer Oliver Kent has called the character consistent because when faced with trauma, Cal gets drunk, sleeps with women and makes a fool of himself.', 'title': 'Caleb Knight'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Vikram is an Indian Tamil film actor. After making his cinematic debut in the 1990 film "En Kadhal Kanmani", he acted in a series of small-budget Tamil, Telugu and Malayalam films. It was Bala\'s tragedy film "Sethu" (1999) that established Vikram in the Tamil film industry. In the early 2000s Vikram appeared in a series of masala films—"Dhill", "Gemini", "Dhool" and "Saamy" all becoming commercially successful. During this period, Vikram performed diverse roles and received critical acclaim for his performances in "Kasi" and "Samurai". In 2003, Vikram\'s performance as an autistic gravedigger in "Pithamagan" won a lot of acclaim and secured his first National Film Award for Best Actor. His portrayal as an innocent man with multiple personality disorder in Shankar\'s "Anniyan" was commercially successful. The film also fetched him a Filmfare Best Actor Award. Vikram\'s portrayal as a tribal leader in Mani Ratnam\'s "Raavanan" saw him secure further acclaim. He is only the third actor to receive a National Film Award for Best Actor in the Tamil film industry. Vikram is known for his intense performances, with his work often fetching critical acclaim and commercial success. He has won a National Film Award and seven Filmfare Awards South, of which five are Best Actor awards.', 'title': 'List of awards and nominations received by Vikram'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Shabbir Jan is a Pakistani television actor who has appeared in many drama serials, such as Wafa, "Makan", "Andata", Survival of a Woman, "Zindagi Dhoop Tum Ghana Saya", "Umrao Jaan", "Jangloos" and "Shab e Gham" and individual play and serials. He won three times PTV best actor award. He has been a nominee once for the Best Actor award in the Lux Style Award, 2002. He has worked television for 33 years and still working.', 'title': 'Shabbir Jan'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'TV Choice is a British weekly TV listings magazine published by H. Bauer Publishing, the UK subsidiary of family-run German company Bauer Media Group. It features weekly TV broadcast programming listings, running from Saturday to Friday, and goes on sale every Tuesday. A double issue is released to cover the Christmas & New Year period at a higher price.', 'title': 'TV Choice'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Ethan Hardy is a fictional character from the BBC medical drama "Casualty", played by actor George Rainsford. He first appeared in the series twenty-eight episode "Bad Timing", broadcast on 11 January 2014. Rainsford\'s casting was announced alongside Richard Winsor who had been hired to play Ethan\'s brother Caleb Knight. The pair were described by the show\'s executive producer Oliver Kent as completely different characters who would change the dynamic on he "Casualty". Ethan is a Specialist registrar in emergency medicine and is an excellent medic who had worked hard to achieve his position in the profession. He is characterised as a shy, socially awkward person with a serious and attentive attitude. Throughout his inclusion in the show Ethan has shared an on-screen friendship with like minded Lily Chao (Crystal Yu). He has had romantic stories alongside the character Honey Wright (Chelsee Healey). Writers developed Ethan\'s relationship with his brother Cal into a sibling rivalry. This has provided both characters with dramatic stories.', 'title': 'Ethan Hardy'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Lydia Patterson Institute is a Methodist Christian college-preparatory school located in El Paso, Texas, United States. Founded in 1913, it offers programs for Spanish-speaking children, primarily from Juarez, to attend high school in the United States and attend an American undergraduate university. All high school classes are taught in English, and the school is accredited by the Southern Association of Colleges and Schools.', 'title': 'Lydia Patterson Institute'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Red Valley/Cove High School is a high school in the community of Red Valley, Arizona, also serving Cove, Arizona. It is operated by the Red Mesa Unified School District. It was created to allow students in the Red Valley and Cove area to attend high school within Arizona; prior to Red Valley/Cove's opening, these areas were served by schools in New Mexico.", 'title': 'Red Valley/Cove High School'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Constitution mandates free and compulsory primary and secondary education in the Republic of Macedonia, and the Law on Primary Education specifies that all children from 6 to 15 years of age attend school for a compulsory 9 years. The Law on High School Education specifies that all adolescents from the ages of 15 - 19 must attend high school for 4 years (or 3 years - depending on the type of school)', 'title': 'Education in the Republic of Macedonia'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Chaminade High School is a Roman Catholic college preparatory high school for boys in Mineola, New York, United States. The school was founded in 1930 by the Society of Mary (Marianists), an international Roman Catholic teaching order of priests and religious brothers. The school is named after William Joseph Chaminade, S.M. (1761–1850), who founded the Marianist order in 1817, and who was beatified by Pope John Paul II in 2000. Operated by the Marianists, Chaminade is independent of the Roman Catholic Diocese of Rockville Centre. The student body numbers over 1,700, mostly from Nassau and Suffolk counties, as well as neighboring New York City. The administration and faculty consists of both Marianists and lay men and women.', 'title': 'Chaminade High School'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Glenn Martin Hughes (July 18, 1950 – March 4, 2001) was the original "Biker" character in the disco group Village People from 1977 to 1996. He graduated in 1968 from Chaminade High School, then attended Manhattan College, where he was initiated as a member of Phi Mu Alpha Sinfonia music fraternity in 1969. He was interested in motorcycles, and was working as a toll collector at the Brooklyn-Battery Tunnel when he responded to an advertisement by composer Jacques Morali seeking "macho" singers and dancers. Hughes and other members of the band were given a crash course in the synchronized dance choreography that later typified the group\'s live performances.', 'title': 'Glenn Hughes (Village People)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Sargent was born in Elsham, North Lincolnshire, the son of a gardener and a housecleaner, and grew up in Winterton, Lincolnshire. Sargent was the first person in his family to attend high school, and the first student from his high school to ever attend college. He received his bachelor's degree from the University of Manchester in 1956, and his Ph.D. in 1959 from the same institution.", 'title': 'Wallace L. W. Sargent'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Laramie High School (LHS) is a high school (grades 9-12) in Laramie, Albany County, Wyoming, United States. In the Albany County School District, high school begins in the 9th grade (freshman year); 9th grade students are now able to attend high school in Laramie due to the building of a new high school. Many LHS students concurrently attend classes at Laramie County Community College (Albany County Campus), or the University of Wyoming.', 'title': 'Laramie High School (Wyoming)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Milford High School (also known as MHS) is the secondary school for the district of Milford, Massachusetts, Milford Public Schools. It is one choice for Milford students to attend high school. Another is Blackstone Valley Regional Vocational Technical High School. The principal is Mr. Joshua Otlin. The assistant principals are Ms. Sissela Tucker (House A) and Mr. Richard Piergustavo (House B).', 'title': 'Milford High School (Massachusetts)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Rich Central High School or RCHS is a public four-year high school located in Olympia Fields, Illinois, a southern suburb of Chicago, Illinois, in the United States. The Rich Central Campus serves the cities of Matteson, Richton Park, Country Club Hills, Chicago Heights, Tinley Park, and parts of Olympia Fields. It is a part of Rich Township District 227, which also includes Rich East High School and Rich South High School. Although the school is located in Olympia Fields, it does not serve the entire village. Some Olympia Fields students attend high school at Homewood-Flossmoor High School and Bloom High School, depending on the subdivision where the student resides.', 'title': 'Rich Central High School'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'East Lyme High School is a high school located in the Flanders Village region of East Lyme, Connecticut. It is operated by East Lyme Public Schools. The mascot is Sven the Viking. Students from the town of Salem, Connecticut in grades 9 through 12 attend high school in East Lyme (as they have no high school of their own); this will be the case until at least 2016 when the current co-op agreement between the two towns expires.', 'title': 'East Lyme High School'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Wire is an American crime drama television series set and produced in Baltimore, Maryland. Created and primarily written by author and former police reporter David Simon, the series was broadcast by the cable network HBO in the United States. "The Wire" premiered on June 2, 2002, and ended on March 9, 2008, comprising 60 episodes over five seasons.', 'title': 'The Wire'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'D\'Angelo "D" Barksdale is a fictional character on the HBO drama "The Wire", played by Larry Gilliard Jr. D\'Angelo is the nephew of Avon Barksdale and a lieutenant in his drug dealing organization which controls most of the trade in West Baltimore. The immorality and ruthlessness of the drug trade gradually wears on his conscience, bringing him into conflict with the Barksdale leadership, most notably Stringer Bell.', 'title': "D'Angelo Barksdale"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Joseph Stewart, better known as "Proposition Joe" or "Prop Joe", is a fictional character on the HBO drama "The Wire", played by actor Robert F. Chew. Joe was an Eastside drug lord who preferred a peaceful solution to business disputes when possible. He was responsible for creating the lucrative New Day Co-Op with Stringer Bell, supplying much of Baltimore with heroin brought into the city by "The Greeks". Joe was a portly and amiable presence, but was often a match in wits for rival drug lords Avon Barksdale and Marlo Stanfield, and was able to manipulate most situations to his advantage. His nickname stemmed from his trademark phrase "I\'ve got a proposition for you", going back to his days selling test answers on the school yard. Along with Poot Carr, Wee-Bey Brice, Omar Little, and Bubbles, he is one of the few characters from the drug trade to appear in every season.', 'title': 'Proposition Joe'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Preston "Bodie" Broadus is a fictional character on the HBO drama series "The Wire", played by actor J. D. Williams. Bodie is initially a rough, low-level drug dealer, but matures throughout the series and slowly rises through the ranks. Bodie is an intelligent and disciplined lieutenant, showing strong loyalty to the Barksdale Organization even after most of its members get imprisoned or killed. Bodie is a relatively goodhearted character who sticks to his principles, but at times he can be violent, such as when he takes part in the murder of a friend and fellow dealer on orders from Stringer Bell. His relationship with the police is also dynamic. He is initially hostile towards all police, but eventually earns the respect of Officer Jimmy McNulty. He is also the only character to move his crew from the Barksdale Organization to the Marlo Stanfield crew.', 'title': 'Bodie Broadus'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Avon Randolph Barksdale is a fictional character in "The Wire", played by Wood Harris. Avon is one of the most powerful drug dealers in Baltimore, Maryland, running the Barksdale Organization. Stringer Bell is his second in command, insulating Avon from law enforcement and potential enemies. Working for Avon and Bell is a large organization of drug dealers and enforcers. Accepting nothing less than absolute power, Avon is shrewd and intuitive, although not as cerebral as Stringer. Avon was partly based on real-life gang leader Nathan Barksdale who ran a drug selling operation in West Baltimore.', 'title': 'Avon Barksdale'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"The Target" is the pilot episode of the HBO original series "The Wire". The episode was written by David Simon from a story by Simon and Ed Burns and was directed by Clark Johnson. It originally aired on June 2, 2002. The title refers to Detective Jimmy McNulty setting his sights on Stringer Bell and Avon Barksdale\'s drug-dealing organization as the target of an investigation.', 'title': 'The Target (The Wire)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Wallace is a fictional character on the HBO drama "The Wire", played by actor Michael B. Jordan. Wallace is a 16-year-old drug dealer for the Barksdale Organization, who works in the low-rise projects crew known as "The Pit" with his friends and fellow dealers Bodie and Poot. When information he provides leads to the brutal death of Brandon Wright, the boyfriend of stick-up artist Omar Little, Wallace feels guilty and tries to leave the drug trade. He informs on the Barksdale Organization to the police, and as a result is killed by Bodie and Poot under orders by drug kingpin Stringer Bell.', 'title': 'Wallace (The Wire)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Idris Akuna Elba {\'1\': ", \'2\': ", \'3\': ", \'4\': "} ( , born 6 September 1972) is an English actor, producer, musician, and DJ. He is known for playing the narcotrafficker Stringer Bell in the HBO series "The Wire", DCI John Luther on the BBC One series "Luther", and Nelson Mandela in the biographical film "" (2013). He has been nominated four times for a Golden Globe Award for Best Actor in a Miniseries or Television Film, winning one, and was nominated five times for a Primetime Emmy Award.', 'title': 'Idris Elba'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Russell "Stringer" Bell is a fictional character in "The Wire", played by Idris Elba. Bell serves as drug kingpin Avon Barksdale\'s second-in-command, assuming direct control of the Barksdale Organization during Avon\'s imprisonment. Bell attends economics classes at Baltimore City Community College and maintains a personal library, including a copy of Adam Smith\'s "The Wealth of Nations". He attempts to legitimize the Barksdale Organization and insulate himself from direct criminality through money laundering and investments in housing development, aided through his buying of influence from politicians.', 'title': 'Stringer Bell'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Maurice "Maury" Levy is a fictional character in the HBO drama "The Wire", played by Michael Kostroff. He is a skilled defense attorney and was kept on retainer by the Barksdale Organization, representing the organization\'s members at trials and advising Avon Barksdale and Stringer Bell on how to avoid investigations for drug trafficking. Levy is corrupt and unscrupulous, willing to aid his clients in furtherance of their criminal activity.', 'title': 'Maurice Levy (The Wire)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Mary Eliza Haweis, née Joy (21 February 1848, in London – 24 November 1898, in Bath, Somerset), was an English author of books and essays, particularly for women, a scholar of Chaucer, illustrator and painter. She was the daughter of the painter Thomas Musgrave Joy, wife of the Rev. Hugh Reginald Haweis and mother of painter Stephen Haweis.', 'title': 'Mary Eliza Haweis'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Elizabeth von Arnim (31 August 1866 – 9 February 1941), born Mary Annette Beauchamp, was an Australian-born British novelist. By marriage she became Countess von Arnim-Schlagenthin, and after her second marriage she was styled as Elizabeth Russell, Countess Russell. Although known in her early life as Mary, after the publication of her first book, she was known to her readers, eventually to her friends, and finally even to her family as Elizabeth and she is now invariably referred to as Elizabeth von Arnim. She also wrote under the pen name Alice Cholmondeley.', 'title': 'Elizabeth von Arnim'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Barbara (Louise) Trapido, born 1941 as Barbara Schuddeboom, is a British novelist born in South Africa with German, Danish and Dutch ancestry. Born in Cape Town and growing up in Durban she studied at the University of Natal gaining a BA in 1963 before emigrating to London. After many years teaching, she became a full-time writer in 1970.', 'title': 'Barbara Trapido'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Walter Karig (13 November 1898 - 30 September 1956) was a prolific author, who served as a US naval captain. Karig wrote a number of works on Allied naval operations during World War II. He also wrote scripts for the television series "Victory at Sea". Besides his works on naval history, Karig was a novelist, publishing under his own name, and a journalist.', 'title': 'Walter Karig'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Oriwa Tahupotiki Haddon (7 November 1898–17 June 1958) was a New Zealand Methodist minister, pharmacist, artist and broadcaster. Of Māori descent, he identified with the Ngati Ruanui iwi. He was born in Waitotara, Wanganui, New Zealand on 7 November 1898.', 'title': 'Oriwa Tahupotiki Haddon'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Grantchester Grind is a novel written by Tom Sharpe, a British novelist born in 1928 who was educated at Lancing College and then at Pembroke College, Cambridge.', 'title': 'Grantchester Grind'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Surprised by Joy: The Shape of My Early Life is a partial autobiography published by C. S. Lewis in 1955. Specifically, the book describes the author's conversion to Christianity which had taken place 24 years earlier.", 'title': 'Surprised by Joy'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "William Black (13 November 1841 – 10 December 1898) was a novelist born in Glasgow, Scotland. During his own lifetime Black's novels were immensely popular, and were compared favourably with those of Anthony Trollope. However, his fame and popularity did not survive long into the twentieth century.", 'title': 'William Black (novelist)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Robert Edric (born 14 April 1956) is the pseudonym of Gary Edric Armitage, a British novelist born in Sheffield. Nick Rennison has suggested that Edric might be "the finest and most adventurous writer of historical fiction of his generation".', 'title': 'Robert Edric'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Clive Staples Lewis (29 November 1898 – 22 November 1963) was a British novelist, poet, academic, medievalist, literary critic, essayist, lay theologian, broadcaster, lecturer, and Christian apologist. He held academic positions at both Oxford University (Magdalen College, 1925–1954) and Cambridge University (Magdalene College, 1954–1963). He is best known for his works of fiction, especially "The Screwtape Letters", "The Chronicles of Narnia", and "The Space Trilogy", and for his non-fiction Christian apologetics, such as "Mere Christianity", "Miracles", and "The Problem of Pain".', 'title': 'C. S. Lewis'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Rowing has featured as a sport at the Youth Olympic Summer Games since its first edition in 2010. The Youth Olympic Games are multi-sport event and the games are held every four years just like the Olympic Games. Summer Youth Olympics racing is held over a course over 1000m course as appossed to 2000m course used at the Olympics.', 'title': 'Rowing at the Youth Olympic Games'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Sailing has featured as a sport at the Youth Olympic Summer Games since its first edition in 2010. The Youth Olympic Games are multi-sport event and the games are held every four years just like the Olympic Games. With sailing limited to four events sailing has chosen to feature athlete under 16 in two disciplines. This allows older youth competitors in sailing to focus on the Olympic disciplines through events like the ISAF Youth Sailing World Championships as the games could permit sailors up to 18 years old.', 'title': 'Sailing at the Youth Olympic Games'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The 2010 Summer Youth Olympics, officially known as the Singapore 2010 Youth Olympic Games (YOG), were an international multi-sport event held in Singapore from 14 to 26 August 2010. The event was the inaugural Youth Olympic Games, and it saw 3,531 athletes between 14 and 18 years of age competing in 201 events in 26 sports. This medal table ranks the 204 participating National Olympic Committees (NOCs) by the number of gold medals won by their athletes. The Kuwait Olympic Committee was suspended by the International Olympic Committee (IOC) prior to the Games, but Kuwaiti athletes were allowed to participate and the country is listed in the table, bearing the Olympic flag.', 'title': '2010 Summer Youth Olympics medal table'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Buenos Aires 2018 Summer Youth Olympic Games (Spanish: 'Juegos Olímpicos de la Juventud de 2018' ) is the third edition of the Summer Youth Olympics, a major international sports in which culture and education are also of great importance, are due to be celebrated in the tradition of the Summer Olympic Games on 6–18 October 2018 in Buenos Aires, Argentina. It will be the first Summer Youth Olympic Games to be held outside Asia and the first Youth Games for either summer or winter to be held outside Eurasia.", 'title': '2018 Summer Youth Olympics'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The 2014 Summer Youth Olympic Games (officially known as II Summer Youth Olympic Games) (Chinese: 第二届夏季青年奧林匹克运动会) were the second Summer Youth Olympic Games, an international sports, education and cultural festival for teenagers, held from 16 to 28 August 2014 in Nanjing, China.', 'title': '2014 Summer Youth Olympics'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Lima ( , ] , Quechua: ] , Aymara: ] ) is the capital and the largest city of Peru. It is located in the valleys of the Chillón, Rímac and Lurín rivers, in the central coastal part of the country, overlooking the Pacific Ocean. Together with the seaport of Callao, it forms a contiguous urban area known as the Lima Metropolitan Area. With a population of more than 10 million, Lima is the most populous metropolitan area of Peru and the third-largest city in the Americas (as defined by "city proper"), behind São Paulo and Mexico City.', 'title': 'Lima'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Brazil has participated at the Youth Olympic Games since the inaugural Summer edition in 2010. As of 2014, Brazil has attended to every edition of the Summer and Winter Youth Olympic Games hosted so far. Brazil is currently ranked 13th on the Summer Games all-time medal table and the country has not yet won a medal at the Winter Youth Olympic Games.', 'title': 'Brazil at the Youth Olympics'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The 2012 Winter Youth Olympic Games (German: "Olympische Jugend-Winterspiele 2012"), officially known as the I Winter Youth Olympic Games (YOG), were an international multi-sport event for youths that took place in Innsbruck, on 13–22 January 2012. They were the inaugural Winter Youth Olympics, a major sports and cultural festival celebrated in the tradition of the Olympic Games. Approximately 1100 athletes from 70 countries competed. The decision for Innsbruck to host the Games was announced on 12 December 2008 after mail voting by 105 International Olympic Committee (IOC) members. Innsbruck is the first city to host three winter Olympic events, having previously hosted the 1964 Winter Olympics and the 1976 Winter Olympics.', 'title': '2012 Winter Youth Olympics'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Athletics has featured as a sport at the Youth Olympic Summer Games since its first edition in 2010. The Youth Olympic Games are multi-sport event and the games are held every four years just like the Olympic Games. Athletes under the age of 18 can participate in the Games. This age group corresponds with the youth category of athletics competition.', 'title': 'Athletics at the Youth Olympic Games'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The South American Youth Olympic Games (Spanish: "Juegos Suramericanos de la Juventud"; Portuguese: "Jogos Sul-Americanos da Juventude") is a regional multi-sport event organized by the Organización Deportiva Suramericana (ODESUR). The games are held every four years consistent with the current Olympic Games format. The first edition was held in Lima, Perú, from 20 to 29 September 2013. The age limitation of the athletes is 14 to 18.', 'title': 'South American Youth Games'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Energy Reorganization Act of 1974 (Pub.L. 93–438 , 88\xa0Stat. 1233 , enacted \xa011, 1974 , codified at 42 U.S.C.A. § 5801) is a United States federal law that established the Nuclear Regulatory Commission. Under the Atomic Energy Act of 1954, a single agency, the U.S. Atomic Energy Commission, had responsibility for the development and production of nuclear weapons and for both the development and the safety regulation of the civilian uses of nuclear materials. The Act of 1974 split these functions, assigning to the Energy Research and Development Administration (now the United States Department of Energy) the responsibility for the development and production of nuclear weapons, promotion of nuclear power, and other energy-related work, and assigning to the NRC the regulatory work, which does not include regulation of defense nuclear facilities. The Act of 1974 gave the Commission its collegial structure and established its major offices.', 'title': 'Energy Reorganization Act of 1974'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Annie Caputo is an American political advisor and government official. Currently serving as senior policy advisor for Chairman John Barrasso (R-WY) on the United States Senate Committee on Environment and Public Works, she is President Donald Trump's nominee to become a member of the Nuclear Regulatory Commission for the remainder of a five-year term expiring on June 30, 2021.", 'title': 'Annie Caputo'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The anti-nuclear movement in the United States consists of more than 80 anti-nuclear groups that oppose nuclear power, nuclear weapons, and/or uranium mining. These have included the Abalone Alliance, Clamshell Alliance, Committee for Nuclear Responsibility, Nevada Desert Experience, Nuclear Information and Resource Service, Physicians for Social Responsibility, Plowshares Movement, and Women Strike for Peace. The anti-nuclear movement has delayed construction or halted commitments to build some new nuclear plants, and has pressured the Nuclear Regulatory Commission to enforce and strengthen the safety regulations for nuclear power plants.', 'title': 'Anti-nuclear movement in the United States'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'More than eighty anti-nuclear groups are operating, or have operated, in the United States. These include: Abalone Alliance, Clamshell Alliance, Greenpeace USA, Institute for Energy and Environmental Research, Musicians United for Safe Energy, Nevada Desert Experience, Nuclear Control Institute, Nuclear Information and Resource Service, Public Citizen Energy Program, Shad Alliance, and the Sierra Club. These are direct action, environmental, health, and public interest organizations who oppose nuclear weapons and/or nuclear power. In 1992, the chairman of the Nuclear Regulatory Commission said that "his agency had been pushed in the right direction on safety issues because of the pleas and protests of nuclear watchdog groups".', 'title': 'Anti-nuclear groups in the United States'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Alliance for Nuclear Responsibility is a non-profit, anti-nuclear, public interest organization founded in 2005, and based in San Luis Obispo, California. It is focused on public citizen activism and public participation with regard to the Diablo Canyon Power Plant, also known as the Diablo Canyon Nuclear Power Plant. The focus of the group is primarily on using leverage at the level of state agencies such as the California Public Utilities Commission. Concurrent jurisdiction of their concern also includes the California Coastal Commission, which certifies compliance of all action within the coastal zone which thus includes the plant. Their posture is primarily oppositional. Other venues for activism include the Nuclear Regulatory Commission, California Energy Commission, Regional Water Quality Control Board, SLO County, the California legislature, the office of the state attorney general, and the US Congress, of which they are in the 23rd District.', 'title': 'Alliance for Nuclear Responsibility'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The nuclear energy policy of the United States developed within two main periods, from 1954–1992 and 2005–2010. The first period saw the ongoing building of nuclear power plants, the enactment of numerous pieces of legislation such as the Energy Reorganization Act of 1974, and the implementation of countless policies which have guided the Nuclear Regulatory Commission and the Department of Energy in the regulation and growth of nuclear energy companies. This includes, but is not limited to, regulations of nuclear facilities, waste storage, decommissioning of weapons-grade materials, uranium mining, and funding for nuclear companies, along with an increase in power plant building. Both legislation and bureaucratic regulations of nuclear energy in the United States have been shaped by scientific research, private industries' wishes, and public opinion, which has shifted over time and as a result of different nuclear disasters.", 'title': 'Nuclear energy policy of the United States'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Special nuclear material is a term used by the Nuclear Regulatory Commission of the United States to classify fissile materials. The NRC divides special nuclear material (SNM) into three main categories, according to the risk and potential for its direct use in a clandestine nuclear weapon or for its use in the production of nuclear material for use in a nuclear weapon.', 'title': 'Special nuclear material'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'David A. Wright is an American businessman, politician, and energy policy advisor. In May 2017, he was nominated by President Donald Trump to become a member of the Nuclear Regulatory Commission for the remainder of a five-year term expiring on June 30, 2020.', 'title': 'David A. Wright'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'A nuclear meltdown (core melt accident or partial core melt) is a severe nuclear reactor accident that results in core damage from overheating. The term "nuclear meltdown" is not officially defined by the International Atomic Energy Agency or by the Nuclear Regulatory Commission. However, it has been defined to mean the accidental melting of the core of a nuclear reactor, and is in common usage a reference to the core\'s either complete or partial collapse.', 'title': 'Nuclear meltdown'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Donald John Trump (born June 14, 1946) is the 45th and current President of the United States, in office since January 20, 2017. Before entering politics, he was a businessman and television personality.', 'title': 'Donald Trump'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Sweet Revenge (also released as "Dandy, the All American Girl") is a 1976 American crime film directed by Jerry Schatzberg. It was entered into the 1976 Cannes Film Festival. This was the second leading role for actress Stockard Channing in a film, following the previous year\'s "The Fortune" in which she co-starred opposite Jack Nicholson and Warren Beatty.', 'title': 'Sweet Revenge (1976 film)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Hoffa is a 1992 French-American biographical crime film directed by Danny DeVito and written by David Mamet, based on the life of Teamsters leader Jimmy Hoffa. Most of the story is told in flashbacks before ending with Hoffa's mysterious disappearance. Jack Nicholson plays Hoffa, and DeVito plays Robert Ciaro, an amalgamation of several Hoffa associates over the years.", 'title': 'Hoffa'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'John Joseph Nicholson (born April 22, 1937) is an American actor and filmmaker, who has performed for over 60 years. Nicholson is known for playing a wide range of starring or supporting roles, including satirical comedy, romance and dark portrayals of antiheroes and psychopathic characters. In many of his films, he has played the "eternal outsider, the sardonic drifter," someone who rebels against the social structure.', 'title': 'Jack Nicholson'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Batman is a 1989 American superhero film directed by Tim Burton and produced by Jon Peters and Peter Guber, based on the DC Comics character of the same name. It is the first installment of Warner Bros.\' initial "Batman" film series. The film stars Michael Keaton as Bruce Wayne/Batman and Jack Nicholson as The Joker, alongside Kim Basinger, Robert Wuhl, Pat Hingle, Billy Dee Williams, Michael Gough and Jack Palance. The film takes place early in the title character\'s war on crime, and depicts a battle with his arch-nemesis the Joker.', 'title': 'Batman (1989 film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Wise Guys is a 1986 black Mafia comedy crime film directed by Brian De Palma and starring Danny DeVito and Joe Piscopo. A comedy revolving around two small-time mobsters from Newark, New Jersey, it also features Harvey Keitel, Ray Sharkey, Lou Albano, Dan Hedaya, and Frank Vincent.', 'title': 'Wise Guys (1986 film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Terms of Endearment is a 1983 American comedy-drama film adapted from Larry McMurtry's 1975 novel, directed, written, and produced by James L. Brooks and starring Shirley MacLaine, Debra Winger, Jack Nicholson, Danny DeVito, Jeff Daniels, and John Lithgow. The film covers 30 years of the relationship between Aurora Greenway (MacLaine) and her daughter Emma (Winger).", 'title': 'Terms of Endearment'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Kill the Irishman (alternatively known as Bulletproof Gangster) is a 2011 American biographical crime film directed by Jonathan Hensleigh, and starring Ray Stevenson, Vincent D\'Onofrio, Christopher Walken, and Val Kilmer. Written by Hensleigh (along with Jeremy Walters), it is based on the life of Irish-American gangster Danny Greene, and was adapted from the book "To Kill the Irishman: The War That Crippled the Mafia" by Rick Porrello.', 'title': 'Kill the Irishman'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Goin' South is a 1978 American western-comedy film, directed by and starring Jack Nicholson, with Mary Steenburgen, Christopher Lloyd, John Belushi, Richard Bradford, Veronica Cartwright, Danny DeVito and Ed Begley, Jr.", 'title': "Goin' South"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Last Detail is a 1973 American comedy-drama film directed by Hal Ashby and starring Jack Nicholson, Randy Quaid, Otis Young, with a screenplay adapted by Robert Towne from a 1970 novel of the same name by Darryl Ponicsan. The film became known for its frequent use of profanity. It was nominated for three Academy Awards, Best Actor in a Leading Role, Jack Nicholson; Best Actor in a Supporting Role, Randy Quaid; and Best Writing, Screenplay Based on Material from Another Medium, Robert Towne.', 'title': 'The Last Detail'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Mars Attacks! is a 1996 American comic science fiction film directed by Tim Burton, who also co-produced it with Larry J. Franco. The screenplay, which was based on the cult trading card series of the same name, was written by Jonathan Gems. The film features an ensemble cast consisting of Jack Nicholson (in a dual role), Glenn Close, Annette Bening, Pierce Brosnan, Danny DeVito, Martin Short, Sarah Jessica Parker, Michael J. Fox, Rod Steiger, Tom Jones, Lukas Haas, Natalie Portman, Jim Brown, Lisa Marie Smith, and Sylvia Sidney. The film is a parody of science fiction B movies overall and includes elements of black comedy and political satire.', 'title': 'Mars Attacks!'}]

