 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'West Adelaide Soccer Club is an Australian soccer club from Adelaide, Australia currently playing in the National Premier Leagues South Australia. It participated in the National Soccer League from the 1977 season until the end of the 1998/99 season, except for the periods 1987–89 and 1990–91. It was also known as West Adelaide Hellas and Adelaide Sharks. They played in various blue and white strips, and played most of their NSL home games at Hindmarsh Stadium. The senior arm of the club re-formed in 2008 and is the FFSA National Premier League 2015 Premiers and 2015 Champions , coached by one of the former NSL players of the club, Paul Pezos.', 'title': 'West Adelaide SC'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Haandbryggeriet is a Norwegian brewery founded in 2005 by Jens Maudal, Rune Eriksen, Arne Eide and Egil Hilde. The brewery was situated at the site of an old textile factory in Drammen, then in a railroad yard, and now resides in an old industrial building. Their brewing equipment was bought used in England and has a capacity of about 900 liters per batch. Production in 2006 was near 40,000 liters. In 2012, production was expected to be approximately 350,000 liters, using a ,800 liter brewing equipment. In 2013, they upgraded yet again, to a 5,000 liter brewing tank.', 'title': 'Haandbryggeriet'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Coopers Brewery Limited, the largest Australian-owned brewery, is based in the Adelaide suburb of Regency Park. Coopers is known for making a variety of beers, the most famous of which are its Pale Ale and Sparkling Ale. The brewery sold 69.7 million litres of beer in the 2013 financial year. It is also the world's largest producer of homebrewing equipment. Its shares are primarily owned by the extended Cooper family, and the company's constitution and classes of shares makes it difficult to sell shares outside the family.", 'title': 'Coopers Brewery'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Birra Tirana "(English: Tirana Beer )" is a beer company based in Tirana, Albania. It is the largest beer producer and the largest selling beer in the country. It is also exported and sold in Kosovo and the United States. The company is fabricated by Birra Malto Brewery. It currently produces three different beer brands. Birra Tirana is sold both in bottles and cans of 0.33 lit and 0.5 lit and also in kegs 30 liters and 50 liters.', 'title': 'Birra Tirana'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Hindmarsh Stadium (currently known as the Coopers Stadium due to sponsorship from the Adelaide-based Coopers Brewery) is a multi-purpose stadium located in Adelaide, South Australia. It is the home of the Australian A-League team, Adelaide United.', 'title': 'Hindmarsh Stadium'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Cerveceria Nacional Dominicana (CND), is the primary beer producer in the Dominican Republic, the company is owned by AmBev and Grupo León Jimenes. It was founded in 1929 by the American entrepreneur Charles H. Wanzer. It was the first brewery in the Dominican Republic and the largest in the Antilles and Central America with sales of 3.8 million hectoliters. It first released its major brand "Presidente" in 1935, and has since expanded to other brands such as Bohemia Especial, Presidente Light and Ambar. The first two are pilsener beers that fall in the category of lager beers, and the latter is the company\'s first incursion into dark beer. CND also distributes Miller products and Heineken. Its current brewery complex was opened in 1951. It employs 2,500 people and produces up to 500 million liters of beer.', 'title': 'Cervecería Nacional Dominicana'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Adelaide United Football Club is a professional soccer club based in Adelaide, South Australia, Australia. The club participates in the A-League under licence from Football Federation Australia. The club was founded in 2003 to fill the place vacated by Adelaide City and West Adelaide in the former National Soccer League (NSL), and is now the sole team from the state of South Australia in the A-League. Adelaide United's home ground is Hindmarsh Stadium. Adelaide United were premiers in the inaugural 2005–06 A-League season, finishing 7 points clear of the rest of the competition, before finishing third in the finals. They were Premiers again in 2015/16 finishing just one point ahead of second place Western Sydney. The Reds made the Grand Finals of the 2006–07, 2008–09 and 2015–16 seasons, losing the on the first two occasions to Melbourne Victory.", 'title': 'Adelaide United FC'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Donald A. Nixon (born 1946) is a businessman. He is the nephew of former President Richard Nixon and the son of Richard Nixon's brother, Donald Nixon and Clara Jane.", 'title': 'Donald A. Nixon'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Harry Robbins "Bob" Haldeman (October 27, 1926 – November 12, 1993) was an American political aide and businessman, best known for his service as White House Chief of Staff to President Richard Nixon and his consequent involvement in the Watergate Affair.', 'title': 'H. R. Haldeman'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ronald H. Walker (born July 25, 1937) is an American executive. Walker served in the administration of President Richard Nixon, first as the first Director of the White House Office of Presidential Advance, and later as Director of the National Park Service (1972–1975). Walker went on to become a senior partner at Korn/Ferry International, President of the Richard Nixon Foundation, and is currently the Chairman of the Board of the Nixon Foundation.', 'title': 'Ronald H. Walker'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'In the context of the Watergate scandal, the term hatchet man was used to refer to a trusted and particularly orthodox subordinate tasked by his employer with destroying a political opponent by any means necessary. Charles Colson was known as a hatchet man for President Richard Nixon, as was H.R. Haldeman, who proudly described himself as "Richard Nixon\'s \'son of a bitch\'". This use of the term has since become commonplace for anyone who is tasked with conducting distasteful, illegal, or unfair "dirty work" to protect the reputation or power of their employer.', 'title': 'Hatchet man (politics)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'United States v. Nixon, 418 U.S. 683 (1974), was a landmark United States Supreme Court decision which resulted in a unanimous 8–0 ruling against President Richard Nixon, ordering him to deliver presidential tape recordings and other subpoenaed materials to the District Court. Issued on July 24, 1974, the ruling was important to the late stages of the Watergate scandal, when there was an ongoing impeachment process against Richard Nixon. "United States v. Nixon" is considered a crucial precedent limiting the power of any U.S. president to claim executive privilege.', 'title': 'United States v. Nixon'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'A memorandum known as the Zilch memo was an American government document sent by National Security Advisor Henry Kissinger to President Richard Nixon on January 3, 1972, about the military situation in Laos during the Vietnam War. On the memo, in his own handwriting, Nixon described the decade-long bombing campaign by the United States in Southeast Asia as a "failure," having achieved "zilch," despite public comments to the contrary. Just the day before, January 2, Nixon told CBS News reporter Dan Rather in an interview that the bombing was "very, very effective." Previously missing from the Richard Nixon Library, the memo was discovered in the possession of Alexander Butterfield, who served as the Deputy Assistant to President Nixon from 1969 to 1973, by "Washington Post" reporter Bob Woodward, who subsequently published it in his 2015 book "The Last of the President\'s Men".', 'title': 'Zilch memo'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Rose Mary Woods (December 26, 1917\xa0– January 22, 2005) was Richard Nixon's secretary from his days in Congress in 1951, through the end of his political career. Before H. R. Haldeman and John Ehrlichman became the operators of Nixon's presidential campaign, Woods was Nixon's gatekeeper.", 'title': 'Rose Mary Woods'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Age of Secrets: The Conspiracy that Toppled Richard Nixon and the Hidden Death of Howard Hughes is a conspiracy theory-oriented biography of Howard Hughes personal advisor John H. Meier. It is written by newspaper reporter Gerald Bellett and was published by the Las Vegas Free Press in 2015. The book argues that Meier was one of the people who played a role in affecting President Richard Nixon's resignation in the wake of the Watergate scandal. It also details how Meier was supposedly pursued for 20 years by the CIA, the Hughes organization, as well as Nixon sympathizers. The book includes an excerpt from Meier's diary regarding what he says is his knowledge regarding the assassination of Robert F. Kennedy.", 'title': 'Age of Secrets'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Nixon v. General Services Administration, 433 U.S 425 (1977), is a landmark court case concerning the principle of presidential privilege and whether the public is allowed to view a President’s “confidential documents”. The Presidential Recordings and Materials Preservation Act, signed into law by President Gerald Ford in 1974, ordered that the Administrator of General Services obtain President Richard Nixon’s presidential papers and tape recordings. In addition, the Act further ordered that government archivists seize these materials. These archivists would preserve the material deemed historic and return to former President Nixon the materials deemed as private. Furthermore, this Act stated that material that was preserved could be used in judicial hearings and proceedings. Immediately after this Act was enacted, Richard Nixon filed a lawsuit in a federal district court claiming that the Act violated the principle of separation of powers, the principle of presidential privilege, Nixon’s personal privacy, his First Amendment right of association, and further asserted that it amounted to a constitutionally prohibited Bill of Attainder.', 'title': 'Nixon v. General Services Administration'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'In 1973, Republican Vice President Spiro Agnew was forced to resign following a controversy over his personal taxes. Under the terms of the 25th Amendment, a vice presidential vacancy is filled when the president nominates a candidate who is confirmed by both houses of Congress. Republican President Richard Nixon thus had the task of selecting a vice president who could receive the majority support of both houses of Congress. Nixon considered selecting former Texas Governor John Connally, New York Governor Nelson Rockefeller, and California Governor Ronald Reagan. However, Nixon settled on House Minority Leader Gerald Ford of Michigan, who was popular among the members of Congress and who was good friends with Nixon. Ford won the approval of both houses by huge margins, and was sworn in as the 40th Vice President of the United States on December 6, 1973. In 1974, Ford ascended to the presidency after the Watergate scandal led to the resignation of President Nixon.', 'title': 'United States vice presidential selection, 1973'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The following is a list of notable current and former fast food restaurant chains, as distinct from fast casual restaurants (see List of casual dining restaurant chains), coffeehouses (see List of coffeehouse chains), ice cream parlors (see List of ice cream parlor chains), and pizzerias (see List of pizza chains).', 'title': 'List of fast food restaurant chains'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '4FINGERS (also known as 4FINGERS Crispy Chicken) is a Singaporean chain of fast casual restaurants that specialises in crispy Asian style fried chicken. Headquartered in Singapore, the chain was founded in 2009 and currently has 21 stores across Singapore, Malaysia, Indonesia and Australia. The company expanded regionally to Malaysia in 2015 with three stores located in Kuala Lumpur], one store in Petaling Jaya and two outlets in Medan, Indonesia. From June–July 2017, 4FINGERS also opened an outlet in Melbourne, Australia[http://www.businessreviewaustralia.com/finance/2431/Singaporean-fried-chicken-chain-4FINGERS-expands-into-Australia <nowiki>[2]</nowiki>] and two outlets in Queensland, Australia, with plans for expansion to Europe and the USA in the future.', 'title': '4 Fingers Crispy Chicken'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Dr. William D. Steers, August 19, 1955 – April 10, 2015, was a Paul Mellon professor and Chair of the Department of Urology at the School of Medicine of the University of Virginia. Dr. Steers is past President of the American Board of Urology (ABU) and Editor of the "Journal of Urology". In 2003, the University of Virginia awarded Dr. Steers the Hovey Dabney Professorship. In 2004 Dr. Steers initiated the Charlottesville Men’s Four Miler road race in Virginia to raise funds for men’s health. Dr. Steers was a viticulturist aficionado, he co-owned Well Hung Vineyard in Charlottesville. He also authored YOURometer an iPhone app. used to record urological related symptoms.', 'title': 'William D. Steers'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Aladdin's Eatery is a chain of franchised restaurants in the American Midwest and South-East, specializing in Lebanese cuisine. Adapted to American tastes, the sites are fast casual restaurants that also offer take out.", 'title': "Aladdin's Eatery"}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': "The Bill Steers Men's 4-Miler (formerly Charlottesville Men's Four Miler) is the only all men's run in the Charlottesville area. The race was rededicated as a tribute to William D. Steers in 2015. It is an annual event hosted by the Department of Urology at the University of Virginia, and the Charlottesville Track Club. The event has also been sponsored by Panera Bread, BMW of Charlottesville, Starbucks, Pepsi and the City of Charlottesville. The City of Charlottesville also hosts the Women's Four Miler to benefit the UVA Cancer Center Breast Care Program. The event, held continuously since 2004, was conceived by William D. Steers with the purpose of raising awareness on men's health issues; to encourage men to take control of their health, and become more physically active.", 'title': "Bill Steers Men's 4-Miler"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'This is a list of casual dining restaurant chains around the world, arranged in alphabetical order. A casual dining restaurant is a restaurant that serves moderately priced food in a casual atmosphere. Except for buffet-style restaurants and, more recently, fast casual restaurants, casual dining restaurants usually provide table service.', 'title': 'List of casual dining restaurant chains'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Chipotle Mexican Grill, Inc. ( ) is an American chain of fast casual restaurants in the United States, United Kingdom, Canada, Germany, and France, specializing in tacos and Mission-style burritos. Its name derives from "chipotle", the Nahuatl name for a smoked and dried jalapeño chili pepper. The company trades on the New York Stock Exchange under the ticker symbol CMG.', 'title': 'Chipotle Mexican Grill'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Panera Bread Company is an American chain of bakery-café fast casual restaurants in the United States and Canada. Its headquarters are in Sunset Hills, Missouri, a suburb of St. Louis, and operates as Saint Louis Bread Company in the St. Louis metropolitan area. Offerings include soups, salads, pasta, sandwiches, specialty drinks, and bakery items.', 'title': 'Panera Bread'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Captain D’s is a U.S.-based chain of fast casual restaurants specializing in seafood. Captain D’s serves a wide variety of seafood that includes freshly prepared entrees and the company’s signature hand batter dipped fish, which is freshly prepared. The restaurants also offer premium-quality grilled items such as shrimp and salmon, as well as hushpuppies, desserts and freshly brewed Southern-style sweet tea.', 'title': "Captain D's"}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'McAlister\'s Deli is an American chain of fast casual restaurants founded in 1989 in Oxford, Mississippi by retired dentist Dr. Don Newcomb. There are currently over 400 locations in 26 states, ranging from Virginia in the East to Florida in the South to Arizona in West to Michigan in the North. The menu includes deli sandwiches, "Texas-size" spuds (baked potatoes), soups, salads, and desserts, as well as catering items such as sandwich trays and boxed lunches. The chain is also known for its McAlister\'s Famous Sweet Tea, which is available by the glass or by the gallon.', 'title': "McAlister's Deli"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Rats were an American garage punk band from Portland, Oregon, formed by Fred Cole previously of the garage rock band, The Lollipop Shoppe. Cole played guitar and sang, his wife, "Toody" played bass and sang, and initially Rod Rat played drums. Their sound was a raw mix of punk rock with occasional country touches. Their self-titled debut album appeared on Cole\'s Whizeagle label in 1980. Soon after, Rod Rat left the band, though he guested on the 1981 follow-up "Intermittent Signals" before his death by suicide. (Prior to his suicide Rod Rat (aka Rod Hibbert) also played drums in 1980-81 for Portland power pop band Domino Theory). Sam Henry, formerly of the Wipers, played drums on this LP but left to join another Portland band, Napalm Beach. Louis Samora was on the drum throne for the 1983 album "In a Desperate Red", still on Whizeagle. Samora left in 1984 to concentrate on his rockabilly band, The Jackals. The band broke up, but Bill Barker of Profile Studios in Vancouver, British Columbia convinced the band to reunite for a single. It appeared under the band name The Desperate Edge later in 1984. Soon after, Cole assembled a country band, Western Front, and he and Toody later reunited in Dead Moon. The Rats\' records have long been out of print and sell for high prices on eBay. In 2008, Portland\'s Mississippi Records reissued the first album on vinyl.', 'title': 'The Rats (American band)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Frankie LaRocka (April 17, 1954 – May 12, 2005), born Frank LaRocca, was an American rock musician and producer. He was a member of Scandal, playing drums on their debut EP, and, at various stages, played the drums with Bon Jovi, David Johansen, Bryan Adams, and John Waite. In the 1990s, he became an A&R man and producer with his most notable work being with the Spin Doctors on their breakthrough album "Pocket Full of Kryptonite".', 'title': 'Frankie LaRocka'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Del-Aires were a Paterson, New Jersey rock band of the 1960s. They were featured as themselves in Del Tenney\'s 1964 B-movie beach party film, "The Horror of Party Beach." For the film, Gary Robert Jones and Ronnie Linares wrote one song together, "Drag," and one song each: "Wigglin\' Wobblin\'" (Jones) and "Elaine" (Linares). The Del-Aires performed all six songs in the film, which included "Joy Ride", "The Zombie Stomp" and "You Are Not a Summer Love." Following his stint with the Del-Aires, saxophonist/guitarist/keyboardist Bobby Osborne was a member of the band Gas Mask, perhaps best known for having their first (and only) album, "Their First Album," produced by Teo Macero.', 'title': 'The Del-Aires'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'A Date with the Smithereens is the fifth album by the New Jersey rock band The Smithereens, released in 1994. It is seen as a stylistic departure by the band, as "A Date" is mainly influenced by hard rock and heavy metal, while previous albums have leaned more towards straightforward pop rock. The title is meant to be ironic as nearly all songs on the album are hate-inspired.', 'title': 'A Date with The Smithereens'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Sean Aaberg was born in Oakland, California. He is the son of Philip Aaberg and LouAnn Lucke. He grew up in Oakland, attending Bishop O\'Dowd High School and briefly attended the California College of the Arts. As a kid, he liked "anything weird, nasty and old", including cheap magazines and bought thousands of them, he said in an interview. He and his friends read "Mad", drew comics, liked to listen to Cheech and Chong and the Ramones on the Dr. Demento show, and later discovered the Church of the Subgenius. He admired the movies of Ralph Bakshi. The interviewer noted that Aaberg writes in ALL CAPS. Sean founded and played drums in the Oakland-based Hardcore Punk band The Masked Men, played drums for Baltimore-based Anarcho Punk band A//Political and founded and played drums for Eugene-based Rock and Roll band The Latrines.', 'title': 'Sean Aaberg'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Live at the Court: Greatest Hits and More is the ninth album from New Jersey rock band The Smithereens. It was recorded live at the Court Tavern in New Brunswick, New Jersey.', 'title': 'Live at the Court: Greatest Hits and More'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Royal Teens was a New Jersey rock and roll band that formed in 1956, which was composed of Bob Gaudio on piano, Tom Austin on drums, Billy Dalton on guitar, and Billy Crandall on saxophone. The group is best known for its single "Short Shorts," which was a #3 hit in the United States in 1958. The follow-up single, 1959\'s "Believe Me," hit #26. They never recorded an album, and broke up in 1965.', 'title': 'Royal Teens'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Bon Jovi is an American rock band from Sayreville, New Jersey. Formed in 1983, Bon Jovi consists of lead singer and namesake Jon Bon Jovi, pianist and keyboardist David Bryan, drummer Tico Torres, lead guitarist Phil X, and bassist Hugh McDonald. The band's lineup has remained mostly static during its history, with the only exceptions being the 1994 dismissal of bass player Alec John Such, who was unofficially replaced by Hugh McDonald, and the departure of longtime guitarist and co-songwriter Richie Sambora in 2013. Phil X and McDonald both became official members in 2016.", 'title': 'Bon Jovi'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Baby Namboos were a 1990s British trip hop band. One of their members, Mark Porter, is the cousin of Tricky, who produced some tracks on their debut album. Their song "Late Night Antics" inspired a New Jersey rock band to call themselves Mister Behavior, a persona mentioned in the song.', 'title': 'The Baby Namboos'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Rosebuds are an indie rock band from Raleigh, North Carolina, United States. (Not to be confused with the vocal group of the same name who recorded for George Goldner\'s Gee Records in the 1950s.) Its current members are Ivan Howard (vocals/guitar/drums/bass/keyboards/programming) and Kelly Crisp (vocals/keyboard/drums/guitar/accordion). Billy Alphin had played drums on the album "The Rosebuds Make Out", Wes Phillips played drums on the E.P."Unwind", Lee Waters played drums on the record "Birds Make Good Neighbors", and Matt McCaughan played the drums on "Night of the Furies", "Life Like" and "Loud Planes Fly Low." Rob Lackey was behind the drum kit during the taping of "The Rosebuds Live at the Cats Cradle", a charity only recording sold at "cytunes.org" to help fight for the prevention of cancer, as well as on the track "Second Birds of Paradise" on "Loud Planes Fly Low."', 'title': 'The Rosebuds'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Fred Cortes (1921-1964) was a Filipino actor who was a favorite leading man of Lvn Pictures before World War II.', 'title': 'Fred Cortes'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'This is a filmography of Welsh actor Ray Milland, containing his work in theatrically released motion pictures as well as his extensive television credits. Milland began his film career in United Kingdom in 1929 after serving three years as a guardsman in the Royal Household Cavalry, based in London. After appearing in several British films, he came to the United States in 1930 where he spent several years playing small and supporting roles. Eventually, in 1934, he became a contract player at Paramount Pictures where he established himself as a popular star. Milland remained with Paramount for the next 21 years. During his time with the studio, he developed his persona as a debonair leading man, mainly in drawing-room comedies but also occasionally in adventure and mystery films. In 1945, Milland won the Academy Award for Best Actor for his portrayal of an alcoholic writer in "The Lost Weekend". From there he continued as a leading man well into the 1960s, appearing in several film noirs and occasionally cast as a villain. In 1953, Milland began working in television as both an actor and director. He alternated between the mediums of film and television for the remainder of his career. During the 1960s and 1970s, Milland frequently worked in science fiction and horror films. He also directed himself in four films.', 'title': 'Ray Milland filmography'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Michèle Mercier (born 1 January 1939 as Jocelyne Yvonne Renée Mercier) is a French actress. In the course of her career she has worked with leading directors like François Truffaut, Jean-Pierre Melville, Jacques Deray, Dino Risi, Mario Monicelli, Mario Bava, Peter Collinson and Ken Annakin. Her leading men have included Marcello Mastroianni, Vittorio Gassman, Jean-Paul Belmondo, Jean Gabin, Charles Aznavour, Robert Hossein, Charles Bronson, Tony Curtis and Charlton Heston. She has appeared in over fifty films, and is best known for her starring role in "Angelique, Marquise des Anges".', 'title': 'Michèle Mercier'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Black Sabbath (Italian: "I tre volti della paura" , \'The Three Faces of Fear\' ) is a 1963 horror film directed by Mario Bava. The film is centered on three separate tales that have an introduction and conclusion from Boris Karloff. The film stars an international cast in three short stories. The first, titled "The Telephone", involves Suzy (Michèle Mercier) who continually receives threatening telephone calls from an unseen stalker. The second is "The Wurdulak", where a man named Gorca (Karloff) returns to his family after claiming to have slain a Wurdulak, an undead creature who attacks those that it had once loved. The third story, "The Drop of Water", features Jacqueline Pierreux as Helen Corey, a nurse who steals a ring from a corpse that is being prepared for burial and finds herself haunted by the ring\'s original owner after arriving home.', 'title': 'Black Sabbath (film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Claudine Mercier (born November 3, 1961) is a Québécoise comedian, singer, actress and impressionist.', 'title': 'Claudine Mercier'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Charles Bronson (born Charles Dennis Buchinsky; Lithuanian: "Karolis Dionyzas Bučinskis" ; November 3, 1921 – August 30, 2003) was an American actor.', 'title': 'Charles Bronson'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Leading man or leading gentleman is an informal term for the actor who is the protagonist or plays a love interest to the leading actress in a film or play. A leading man is sometimes an all-rounder; capable of singing, dancing, and acting at a professional level.', 'title': 'Leading man'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Robert Hossein (born Robert Hosseinoff; 30 December 1927) is a French film actor, director, and writer of Azerbaijani and Jewish origin. He directed the 1982 adaption of "Les Misérables", and appeared in "Vice and Virtue", "Le Casse", "Les Uns et les Autres" and "Venus Beauty Institute". His other roles include Michèle Mercier\'s husband in the "Angélique" series, a gunfighter in the Spaghetti Western "Cemetery Without Crosses" (which he also directed and co-wrote), and a Catholic priest who falls in love with Claude Jade and becomes a communist in "Forbidden Priests".', 'title': 'Robert Hossein'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'John Gilbert (born John Cecil Pringle; July 10, 1899 – January 9, 1936) was an American actor, screenwriter and director. He rose to fame during the silent film era and became a popular leading man known as "The Great Lover". At the height of his career, Gilbert rivaled Rudolph Valentino, another silent film era leading man, as a box office draw.', 'title': 'John Gilbert (actor)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Wang Kuan Hsiung was a lean dapper Taiwanese actor who was a well-known and popular leading man in the Kung Fu film genre of the 1970s and 1980s. He was cast as a romantic leading man in some of his films and he gained many female fans and is still considered a heart throb He is mostly known for his role in a 1974 film as Chan Ming Lung a.k.a. "The Iron Ox" in Iron Ox, The Tiger\'s Killer, which is a tale about a student taking on a group of men, The Five Tigers in duels to avenge the death of his teacher. This film also featured a well-known actor of the genre, Wong Fei-Lung', 'title': 'Wang Kuan-hsiung'}]

