 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Richard Fabián Sosa Zapata (born January 5, 1972 in Montevideo) is a Uruguayan former footballer who played as a midfielder for Villa Española and for Chilean club Puerto Montt.', 'title': 'Richard Sosa'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Anthony Philip David Terry Frank Donald Stanley Gerry Gordon Stephen James Oatway (born 28 November 1973), more commonly known as Charlie Oatway, is an English former footballer. Oatway retired from the professional game in August 2007. He was assistant manager and a player at Havant & Waterlooville but departed the club in June 2009. He is currently an analyst with Shanghai Shenhua, continuing his integral role within Gus Poyet's management team having previously worked with him at Brighton, Sunderland, AEK Athens and Real Betis Balompié.", 'title': 'Charlie Oatway'}
