 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Ruben Wálter Paz Márquez (born 8 August 1959 in Artigas) is a Uruguayan former footballer who played as a midfielder. Paz played at two FIFA World Cups for Uruguay and was also South American Footballer of the Year in 1988. He retired in 2006 at the age of 47. He's currently Peñarol's assistant coach.", 'title': 'Rubén Paz'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Octavio Darío Rodríguez Peña (born 17 September 1974 in Montevideo) is a Uruguayan former footballer who played as a centre back or left back for Peñarol. He was capped 51 times for the Uruguay national team. A versatile defender, he was capable of playing "at left-back or as a left-sided central defender. Strong in the air, he [wa]s a useful distraction in the opposition box at set pieces."', 'title': 'Darío Rodríguez'}
