 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Álvaro Alexander Recoba Rivero (] ; born 17 March 1976; nickname "El Chino") is a Uruguayan former footballer, who last played for Primera División Uruguaya side Nacional, as either a forward or midfielder. Although he began and ended his footballing career in his native country, he also played for several European clubs throughout his career, most notably Italian side Inter Milan, where he spent 11 seasons.', 'title': 'Álvaro Recoba'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Cork City Ballet is an Irish ballet company founded by Alan Foley, a disciple of Joan Denise Moriarty, in 1992. It is one of two professional ballet companies in Ireland. Cork City Ballet annually performs at Cork Opera House, most recently with a production of Giselle. It has toured venues such as Wexford Opera House, The Helix Tralee's Siamsa Tire and University Concert Hall, Limerick. Cork City Ballet is known for working with an array of guest artists from companies such as Royal Swedish Ballet and Kirov Ballet. In 2012, Cork City Ballet commemorated the centenary of the birth of Joan Denise Moriarty, the founder of Irish Theatre Ballet, Ireland's first professional ballet company.", 'title': 'Cork City Ballet'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Other Side of Immigration is a 2010 documentary film directed by Roy Germano that explores why so many people leave the Mexican countryside to work in the United States and what happens to the families and communities they leave behind. The film is based on Germano’s interviews with over 700 households in Mexico, which he carried out while doing Ph.D. research on remittances at the University of Texas at Austin. "The Other Side of Immigration" is distributed by Team Love Records, a company founded by musician Conor Oberst.', 'title': 'The Other Side of Immigration'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'In 1870, Vanderbilt had 150 inhabitants, two boarding houses and two saloons, although 300 miners were employed in the mining district in those times. When Eureka had begun to boom, many people of Vandelbilt had moved there. In 1872 a disaster has occurred in Vanderbilt: a fire destroyed the mill. In 1880, only 25 people lived in Vanderbilt, in 1885 the post office was closed and the few active mines had closed by 1887. Now, the only vestiges of the town are mill ruins. Because the road to Vanderbilt is very treacherous, is very dangerous to reach the place.', 'title': 'Vanderbilt, Nevada'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Federal Music Project (FMP), part of the Federal government of the United States New Deal program Federal Project Number One, employed musicians, conductors and composers during the Great Depression. In addition to performing thousands of concerts, offering music classes, organizing the Composers Forum Laboratory, hosting music festivals and creating 34 new orchestras, employees of the FMP researched American traditional music and folk songs, a practice now called ethnomusicology. In the latter domain the Federal Music Project did notable studies on cowboy, Creole, and what was then termed Negro music. During the Great Depression, many people visited these symphonies to forget about the economic hardship of the time. In 1939, the FMP transitioned to the Works Progress Administration's Music Program, which along with many other WPA projects, was phased out in the midst of World War II.", 'title': 'Federal Music Project'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Denise Coates CBE (born 26 September 1967) is an English businesswoman, founder and joint chief executive of online gambling company Bet365. She has been listed in the "Forbes" magazine’s rich list, with an estimated personal fortune of $4.1 billion (approximately £3.17 billion).', 'title': 'Denise Coates'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Salakos (Greek: Σάλακος) is a village of 350 people on the west side of Rhodes Island. It is 40 km from the capital Rhodes town and 7km from the North West coast. The village is located on the hills of Mount Prophitis Ilias. Inhabitants are mainly employed in farming, livestock rearing and tourism. The village is located next to a natural spring named Nymph, which is a mythological deity that protected the spring. There is one tourist hotel in the village (ironically also named Nymph), and several restaurants that cater to passing foreign tourist trade and in the summer months many people work in tourist hotels elsewhere. The village is famous for its walnuts, numerous sightseeing walks and its stone-paved and shady square, with fresh spring running water and fig trees.', 'title': 'Salakos'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Larkin Company, also known as the Larkin Soap Company, was a company founded in 1875 in Buffalo, New York as a small soap factory. It grew tremendously throughout the late 1800s and into the first quarter of the 1900s with an approach called "The Larkin Idea" that transformed the company into a mail-order conglomerate that employed 4,000 people and had annual sales of $28.6\xa0million ( ) in 1920. The company\'s success allowed them to hire Frank Lloyd Wright to design the iconic Larkin Administration Building which stood as a symbol of Larkin prosperity until the company\'s demise in the 1940s.', 'title': 'Larkin Company'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Bet365 Group Ltd (styled as "bet365") is a gambling company based in the United Kingdom. Bet365 is one of the world\'s leading online gambling groups with over 19 million customers in almost two hundred countries. The Group employs over 3,000 people and is the largest private employer in the city of Stoke-on-Trent.', 'title': 'Bet365'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Bill Allen (04/06/37) is the former CEO of the Alaska oilfield services company VECO Corporation. VECO was an Alaska-based oil pipeline service and construction company founded by Wayne Veltri (VECO is short for Veltri Co). Bill Allen was born in New Mexico and at the age of 16 left for the oil fields of Alaska to become a welder to help support his family. VECO began as a one truck welding and repair operation that grew to become a major player in the Alaskan and worldwide oil industries' support services business. He built a for-profit prison in Barbados as well. VECO also was a worldwide player in the oil industry, having divisions in many major oil markets, including the Sudan, Russia, Mexico, Venezuela and Syria. VECO had a major impact on the economy of Alaska and employed over 5,000 people worldwide.", 'title': 'Bill Allen (corporate CEO)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Matsari (मत्सरी) is a village development committee in Rautahat District in the Narayani Zone of south-eastern Nepal. It is one of the highly famous village of Maithil Brahmins (e.g. Jha, Mishra) in Nepal. The village takes its name from "MATSA" which means "Fish". At the time of the 1991 Nepal census it had a population of 3157 people living in 564 individual households. The literacy of this village is higher than any of the others in the country. The village is situated at the bank of Bagmati river. It lies around 8km(~5 miles) north of the district headquarters Gaur. Most of the people of the village are employed in the "Government Service" of Nepal. "Durga-puja" of "Dashara" is very famous here, many people from various villages show up to observe the festival. Bhojpuri/Bajika/Maithili are the languages spoken in the village.', 'title': 'Matsari'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The 2010–11 Copa del Rey was the 109th staging of the Copa del Rey. The competition began on 21 August 2010 and ended on 20 April 2011 with the final, held at the Estadio Mestalla in Valencia, in which Real Madrid lifted the trophy for the eighteenth time in their history with a 1–0 victory over Barcelona in extra time. Sevilla were the defending champions, but they were defeated by Real Madrid in the Semi-finals.', 'title': '2010–11 Copa del Rey'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Del Rey Manga was the manga-publishing imprint of Del Rey Books, a branch of Ballantine Books, which in turn is part of Random House, the publishing division of Bertelsmann. It was formed as part of a cross-publishing relationship with Japanese publisher Kodansha. Some of the Del Rey titles, such as "Tsubasa Chronicle" and "xxxHolic", are published in the United Kingdom by Tanoshimi. Tricia Narwani, the editor of Del Rey, stated that "Del Rey finds most of its talent through conventions and existing professional contacts."', 'title': 'Del Rey Manga'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "The 2012 Copa del Rey Final was the 110th final since its establishment. The match was contested by Athletic Bilbao and Barcelona on 25 May 2012 at the Vicente Calderón in Madrid. This was the clubs' first meeting in the final since the 2009 final where Barcelona won the trophy with a 4–1 victory. The same teams, which are the two with the most cup wins in the history of the competition, also met in the Round of 16 of the 2010–11 edition, in which Barça prevailed on away goals after two draws. Barcelona lifted the trophy for the 26th time in their history.", 'title': '2012 Copa del Rey Final'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Sara Amato (born November 13, 1980) is an American professional wrestling trainer and retired professional wrestler best known by her ring name Sara Del Rey. She was a mainstay for Chikara and Shimmer, but also appeared for many other independent promotions in the United States, including Ring of Honor (ROH), IWA Mid-South and All Pro Wrestling, as well as Mexico's Lucha Libre Femenil. Del Rey also taped several matches, competing under a mask and using the name Nic Grimes, for the MTV promotion Wrestling Society X. Del Rey was the inaugural Shimmer Champion and co-holder of the Shimmer Tag Team Championship with Courtney Rush, making her the promotion's first double champion. In 2012, Del Rey became only the fourth woman to make it to Pro Wrestling Illustrated's list of top 500 wrestlers in the world. She is currently employed by World Wrestling Entertainment (WWE) as the Assistant Head Coach and producer of their developmental territory NXT, based at the WWE Performance Center.", 'title': 'Sara Del Rey'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Yayo" is a song by American singer and songwriter Lana Del Rey. It appears on her first extended play, "Kill Kill", her debut album, "Lana Del Ray", and her third EP, "Paradise". After the release of her third EP, the song charted in France. Before signing to a major record label, Del Rey released a self-produced music video for "Yayo". Ubiquitously, the song garnered acclaim, many reviewers saying the song was one of the best songs Del Rey has ever written and praising Del Rey\'s voice. Appearing on three of Del Rey\'s albums to date, the song is one of few that was authored solely by her. The original version of the song was released through 5 Point Records and produced by David Kahne, later being remastered by Emile Haynie and Dan Heath.', 'title': 'Yayo (Lana Del Rey song)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'American singer and occasional actress Lana Del Rey has appeared in three films as an actress, eighteen television shows, and three commercials, along with offering her talents to five films as singer. Del Rey\'s first appearance was in the independent film "Poolside" (2010), which features Del Rey playing Lisa, a rich girl who spends her days smoking cigarettes by the pool. She received top billing for the project. Del Rey\'s next appearance was in a less-than-one-minute long short art film titled "Lana Del Rey" which was produced by Interview magazine and features noir-ish style and cinematic themes. Del Rey\'s breakout appearance was in an Anthony Mandler directed film, which Del Rey wrote, titled "Tropico" (2013). The film features Del Rey as a fictionalized version of Eve while also playing the Virgin Mary. "Tropico" received positive reviews and was Del Rey\'s second film that gave her top billing. Along with appearing in a handful of short films, Del Rey has appeared in 18 television shows and specials as herself along with appearing in campaign commercials for companies including Keds and H&M.', 'title': 'Lana Del Rey videography'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Summertime Sadness" is a song by American singer and songwriter Lana Del Rey from her second studio album, "Born to Die". The trip hop ballad was released on June 22, 2012 by Interscope Records as the fourth single of the album. Charting across Europe, the single reached the top ten in Austria, Bulgaria, Germany, Greece, Luxembourg, and Switzerland. In the spring of 2013, "Summertime Sadness" reached number one in Poland, Ukraine and Armenia. Trap and house remixes of "Summertime Sadness" helped Del Rey break into the US Hot Dance Club Songs chart. That chart is where Del Rey\'s song became a modest hit and marked her first foray into the chart. On the accompanied Dance/Mix Show Airplay chart, the single gave Del Rey her first US number-one single in August 2013. Earlier in 2012, the song also managed to become a rock hit in the US.', 'title': 'Summertime Sadness'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Tropico is a short film "based on the Biblical story of sin and redemption", starring Lana Del Rey as Eve and Shaun Ross as Adam. Written by Del Rey and directed by Anthony Mandler, the film premiered at the Cinerama Dome in Hollywood, California on December 4, 2013, before being uploaded to Del Rey\'s official Vevo account the following day. It features the songs "Body Electric", "Gods & Monsters", and "Bel Air", all taken from Del Rey\'s 2012 EP "Paradise". An EP of the film\'s name was also released that same month to the iTunes Store; it includes the film itself along with the three aforementioned songs.', 'title': 'Tropico (film)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Lana Del Rey is the second EP by American singer and songwriter Lana Del Rey. It was released on January 10, 2012 in the United States and Canada through Interscope Records. After publishing two unsuccessful works, an EP, "Kill Kill" (2008) and a studio album, "Lana Del Ray" (2010), the four-track EP was released in anticipation of Del Rey\'s major label debut "Born to Die" (2012). The tracks are influenced by several genres, including indie pop, hip hop, and alternative music. The lyrics and melody were written primarily by Del Rey, Patrik Berger, and Justin Parker. Production of the album was led by Emile Haynie, who also co-wrote "Blue Jeans".', 'title': 'Lana Del Rey (EP)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Lana Del Ray (alternatively written as Lana Del Ray a.k.a. Lizzy Grant) is the debut studio album by American singer and songwriter Lana Del Rey. The album was released digitally via the iTunes Store by 5 Points Records on January 4, 2010 when she was known as Lana Del "Ray". However, the record was eventually pulled from retailers soon afterwards because, according to Del Rey, the label was unable to fund it. Del Rey ultimately bought back the rights to the album, whose title uses an alternate spelling of the singer\'s stage name, "Del Rey" being spelled "Del Ray" instead. After releasing "Born to Die" (2012) under her stage name Lana Del Rey, she expressed her wish to re-release the album.', 'title': 'Lana Del Ray (album)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Homero Enrique Cárdenas Guillén (13 March 1966 – allegedly died on 28 March 2014), also known by his aliases El Majadero and El Orejón, was a Mexican suspected drug lord and alleged leader of the Gulf Cartel, a drug trafficking organization. He is the brother of the former Gulf Cartel leaders Antonio, Mario, and Osiel Cárdenas Guillen. During the late 1990s, Homero worked for the Gulf Cartel under the tutelage of his brothers. However, after several years of government crackdowns, the Gulf Cartel suffered severe drawbacks, including the death and arrests of Homero's brothers and allies. In August 2013, Homero became the de facto leader of the Gulf Cartel following the arrest of Mario Ramírez Treviño. However, he reportedly died of a heart attack on 28 March 2014.", 'title': 'Homero Cárdenas Guillén'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Mario Alberto Cárdenas Guillén is a former leader of the Mexican criminal group called the Gulf Cartel. He is the brother of Osiel Cárdenas Guillén and Antonio Cárdenas Guillén.', 'title': 'Mario Cárdenas Guillén'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Arturo Guzmán Decena (a.k.a. Z-1) (13 January 1976 – 21 November 2002) was a Mexican Army Special Forces operative who in 1997 defected to the Gulf Cartel and subsequently founded the criminal syndicate's enforcement wing at the behest of drug baron Osiel Cárdenas Guillén. Known today as Los Zetas, the cartel's armed wing ultimately broke apart and formed its own drug trafficking organization.", 'title': 'Arturo Guzmán Decena'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Héctor Manuel Sauceda Gamboa (died 17 February 2009), commonly referred to by his alias El Karis, was an alleged drug trafficker and high-ranking leader of the Gulf Cartel (Spanish: "Cártel del Golfo"), a Mexican drug trafficking organization. He was the brother of the drug lord Gregorio Sauceda Gamboa, another high-ranking drug trafficker who worked under the tutelage of Osiel Cárdenas Guillén, the former top leader of the cartel.', 'title': 'Héctor Manuel Sauceda Gamboa'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Osiel Cárdenas Guillén (born May 18, 1967) is a former Mexican drug lord and the former leader of the Gulf Cartel (Spanish: "Cártel del Golfo" ) and Los Zetas. Originally a mechanic in Matamoros, Tamaulipas, where he was born, he entered the Gulf Cartel by helping Juan García Abrego, the capo at the time; when García Ábrego was arrested in 1996, some infighting erupted within the cartel. Osiel Cárdenas eventually took control by killing his friend and contender Salvador Gómez, earning Cárdenas the nickname ""El Mata Amigos"" (The Friend-Killer).', 'title': 'Osiel Cárdenas Guillén'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'La Familia Michoacana, (English: "The Michoacán Family") La Familia (English: "The Family"), or LFM was a Mexican drug cartel and a organized crime syndicate based in the Mexican state of Michoacán. Formerly allied to the Gulf Cartel—as part of Los Zetas—it split off in 2006. The cartel was founded by Carlos Rosales Mendoza a close associate of Osiel Cárdenas. The second leader, Nazario Moreno González, known as "El Más Loco" (English: "The Craziest One"), preached his organization\'s divine right to eliminate enemies. He carried a "bible" of his own sayings and insisted that his army of traffickers and hitmen avoid using the narcotics they sell. Nazario Moreno\'s partners were José de Jesús Méndez Vargas, Servando Gómez Martínez and Enrique Plancarte Solís, each of whom has a bounty of $2 million for his capture, and were contesting the control of the organization.', 'title': 'La Familia Michoacana'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Carlos Alberto Rosales Mendoza (12 February 1963 – 27 December 2015) was a former Mexican drug lord who founded and led an organized crime syndicate called La Familia Michoacana. He was a close friend and associate of Osiel Cárdenas Guillén, the former leader of the Gulf Cartel.', 'title': 'Carlos Rosales Mendoza'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Joaquín Archivaldo Guzmán Loera (] ; born on 25 December 1954 or 4 April 1957) is a Mexican drug lord who headed the Sinaloa Cartel, a criminal organization named after the Mexican Pacific coast state of Sinaloa where it was formed. Known as "El Chapo" ("Shorty", ] ) for his 168 cm stature, he became Mexico\'s top drug kingpin in 2003 after the arrest of his rival Osiel Cárdenas Guillén of the Gulf Cartel, and was considered the "most powerful drug trafficker in the world" by the United States Department of the Treasury.', 'title': 'Joaquín &quot;El Chapo&quot; Guzmán'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Samuel Flores Borrego (a.k.a. Metro 3) (6 August 1972 – 2 September 2011) was a Mexican drug lord and high-ranking lieutenant of the Gulf Cartel. He was a former state judicial policeman who protected the ex-leader of the Gulf cartel, Osiel Cárdenas Guillén. Upon his arrest, Flores Borrego became the right-hand man of Jorge Eduardo Costilla Sánchez, the former leader of the criminal organization.', 'title': 'Samuel Flores Borrego'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Rafael Cárdenas Vela (a.k.a. "El Junior") is a former Mexican drug lord and high-ranking lieutenant of the Gulf Cartel. He is the nephew of Antonio and Osiel Cárdenas Guillén, two men who at one time led the criminal organization.', 'title': 'Rafael Cárdenas Vela'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Springfield Park was a multi-purpose stadium in Wigan, Greater Manchester. It was the home ground of Wigan Athletic F.C. until the club moved to the new JJB Stadium (now DW Stadium) after the 1998–99 season. At its largest, the stadium held 40,000. In its 102-year existence the ground only saw 32 years as a Football League venue, 11 years for Wigan Borough F.C. and 21 years for Wigan Athletic FC, before it was demolished to make way for a housing estate in 1999.', 'title': 'Springfield Park (Wigan)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Nicholas Edward "Nick" Powell (born 23 March 1994) is an English professional footballer who plays for Wigan Athletic as a midfielder. He began his career at Crewe Alexandra, initially as a forward, making his debut at the age of 16. After impressing for Crewe Alexandra during the 2011–12 season, including scoring in their 2–0 victory in the League Two play-off Final, he moved to Manchester United in July 2012. Unable to break into the Manchester United first team, however, he went on loan to Wigan Athletic, Leicester City and Hull City before being released in June 2016. He joined Wigan Athletic in July 2016. He has represented England at under-16, under-17, under-18, under-19 and under-21 levels.', 'title': 'Nick Powell'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "The 2017–18 season is Wigan Athletic's 86th year in existence and their first back in League One, after being relegated the previous season. Along with competing in the league, the club will also participate in the FA Cup, EFL Cup and EFL Trophy. Paul Cook was appointed as manager on 31 May 2017, signing a 3 year deal, following the departure of much of the previous coaching staff the day before.", 'title': '2017–18 Wigan Athletic F.C. season'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The 1979–80 season was the 42nd season in the history of Wigan Athletic F.C. and their second as a professional club in the Football League.', 'title': '1979–80 Wigan Athletic F.C. season'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Wigan Borough F.C. was an English football club based in the town of Wigan. The club was founded in 1920 and joined the Lancashire Combination. In 1921, Borough turned professional when their application was accepted to play in the inaugural season of the newly formed Football League Third Division North. The team played in the Football League for ten seasons, with their most successful season coming in 1928–29, finishing fourth in the league and reaching the third round of the FA Cup. Wigan Borough folded during the 1931–32 season due to financial problems, and League football did not return to the town until Wigan Athletic F.C. were elected into the Football League in 1978.', 'title': 'List of Wigan Borough F.C. players'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The 1978–79 season was the 41st season in the history of Wigan Athletic F.C. and their first as a professional club in the Football League. After finishing 2nd in the Northern Premier League during the previous season, the club was nominated to apply for Football League status, and were elected into the league to replace Southport. After a poor start, the club exceeded expectations in the league, and towards the end of the season, a second consecutive promotion seemed possible. The club eventually fell short, finishing the season in 6th place with a total of 55 points.', 'title': '1978–79 Wigan Athletic F.C. season'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Trinidad and Tobago League Cup, or commonly known as the First Citizens Cup for sponsorship reasons, is the league cup style football competition open for Trinidad and Tobago teams competing in the country\'s TT Pro League. Similar to the FA Trophy, it is played on a knockout (single elimination) basis in September and October towards the beginning of each Pro League season. Unlike the FA Trophy, where 36 teams enter each season from the top three tiers of the Trinidad and Tobago football league system and the Secondary Schools Football League, only teams from the TT Pro League compete in the league cup. The knockout tournament was inaugurated in 2000 and is currently sponsored by First Citizens Bank. Although the league cup is one of the three major domestic trophies attainable by Trinidad and Tobago league teams, it is perceived as a lower priority than the league championship and the FA Trophy. The current theme is "Where Winners Reign", with TT$110,000 to the winner, TT$20,000 to the runners-up, semifinal winners receive TT$7,000, quaterfinal winners receive TT$5,000 and Play-off round winners receive TT$3,000.', 'title': 'Trinidad and Tobago League Cup'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "The EFL Cup (referred to historically, and colloquially, as simply the League Cup), currently known as the Carabao Cup for sponsorship reasons, is an annual knockout football competition in men's domestic English football. Organised by the English Football League (EFL), it is open to any club within the top four levels of the English football league system – 92 clubs in total – comprising the top level Premier League, and the three divisions of the English Football League's own league competition (Championship, League One and League Two).", 'title': 'EFL Cup'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 2007–08 Wigan Athletic F.C. season was the club's 30th season in the Football League and their third season in the Premier League.", 'title': '2007–08 Wigan Athletic F.C. season'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The 2006–07 Wigan Athletic F.C. season was the club's 29th season in the Football League and their second season in the Premier League.", 'title': '2006–07 Wigan Athletic F.C. season'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Selena Quintanilla-Pérez (April 16, 1971 – March 31, 1995) was an American singer who achieved international fame as a member of Selena y Los Dinos and for her subsequent solo career in both Spanish and English Her father and manager, Abraham Quintanilla Jr., appointed Yolanda Saldívar president of Selena's fan club in 1991 after Saldívar had repeatedly asked permission to start one. In January 1994, Saldívar was promoted to manager of the singer's boutiques. Selena's employees, fashion designer, and cousin began complaining about Saldívar's management style. In January 1995, Quintanilla, Jr. began receiving telephone calls and letters from angry fans who had sent membership payments and had received nothing in return. He began investigating their complaints and found evidence that Saldívar had embezzled $60,000 from the fan club and the boutiques using forged checks. After the Quintanilla family confronted her, Saldívar bought a gun, lured Selena to a motel room, and shot her in the back. Although doctors tried to revive Selena, she was pronounced dead from loss of blood and cardiac arrest.", 'title': 'Murder of Selena'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Yolanda Saldívar (born September 19, 1960) is an American woman who was convicted of the murder of Tejano singer, Selena Quintanilla-Pérez on March 31, 1995, at the Days Inn motel in Corpus Christi, Texas. She will be eligible for parole on March 30, 2025.', 'title': 'Yolanda Saldívar'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Selena (Selena Quintanilla-Pérez, 1971–1995) was an American singer.', 'title': 'Selena (disambiguation)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Mirador de la Flor (English: Lookout of the Flower ) is a monument in Corpus Christi, Texas that was unveiled in 1997 to honor Selena Quintanilla-Pérez, the Tejano singer who was murdered by her assistant and head of her fan club Yolanda Saldívar, two years earlier at the age of 23. People from around the world visit the site, which is located only a few miles north of Seaside Memorial Park where Selena is buried. It is located at the corner of Peoples Street T-Head and Shoreline Boulevard and consists of a 5\'8" life-sized bronze statue of Selena wearing a leather jacket with microphone in hand, sculpted by H.W. "Buddy" Tatum, a Corpus Christi artist. She is leaning against a concrete pillar looking towards the Corpus Christi Bay.', 'title': 'Mirador de la Flor'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Selena Forever is an American stage musical, based on the film "Selena", that tells the life of the famous Tejano singer Selena Quintanilla-Pérez. The musical has been staged under two titles. The first - "Selena Forever" was conceived with book and original lyrics by Edward Gallardo and original music by Fernando Rivas as well as additional songs that were originally performed by Selena herself. The musical premiered at the San Antonio Municipal Auditorium before launching on an ill-fated 30 city tour. The musical was then restaged as "Selena: A Musical Celebration of Life" in Los Angeles.', 'title': 'Selena Forever'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Selena is a 1997 American biographical musical drama film written and directed by Gregory Nava about the life and career of the late Tejano music star Selena Quintanilla-Pérez, a recording artist well known in the Mexican American and Hispanic communities in the United States and Mexico before she was murdered by Yolanda Saldívar, the president of her fan club, at the age of 23.', 'title': 'Selena (film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Selena ¡VIVE! (English: Selena Lives! ) was a benefit concert which was held on the tenth anniversary of the death of Tejano superstar Selena Quintanilla-Pérez. The concert was held on April 7, 2005 at the Reliant Stadium in Houston, Texas with over 70,000 attendees. The special was produced and filmed by the Spanish language network, Univision, and is the most watched Spanish-language special in U.S. history.', 'title': 'Selena ¡VIVE!'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Selena Quintanilla-Pérez (April 16, 1971\xa0– March 31, 1995) was an American Tejano singer, songwriter, spokesperson, actress and fashion designer. She was born in Lake Jackson, Texas, 54 miles south of Houston, and her family moved to Corpus Christi after declaring bankruptcy. Her father, a musician before her birth, formed his children into Selena y Los Dinos (with A.B. Quintanilla on bass, Suzette Quintanilla on drums and Selena singing) when he discovered her musical talent. Selena received the Tejano Music Award for Female Vocalist of the Year for nine consecutive years, beginning in 1987. She signed her first major contract with EMI Latin in 1989, releasing four Spanish-language albums which were milestones in the Latin music industry. EMI Latin then wanted her to release a crossover album, transitioning from Spanish- to English-language pop songs. On March 31, 1995, Selena was shot and killed by Yolanda Saldivar, her friend and the former manager of her boutiques. Reaction to her death was compared to the grief following the deaths of musicians John Lennon and Elvis Presley and U.S. president John F. Kennedy.', 'title': 'List of people influenced by Selena'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Corpus: A Home Movie about Selena (1998) is a film by filmmaker, Lourdes Portillo about Mexican American singer-songwriter Selena Quintanilla-Pérez. It places emphasis on the transformation of Selena from a popular entertainer into a modern-day saint and role model. This documentary uses authentic home videos, news stories, footage from concerts and a debate between intellectuals to analyze the effect of Selena and Selena’s murder at the hands of Yolanda Saldivar, the president of her fan club.', 'title': 'Corpus: A Home Movie About Selena'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Selena Remembered is a DVD/CD by Mexican-American Tejano singer Selena Quintanilla-Pérez, released on April 1, 1997 on VHS and on January 25, 2005 on DVD. The DVD features Edward James Olmos narrating special moments and triumphs that helped Selena, and her band Selena y Los Dinos, into superstardom in North America. The DVD\'s logo "Her Life", "Her Music", and "Her Dream" are featured on both the DVD and CD covers.', 'title': 'Selena Remembered'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Target Australia Pty Ltd (formerly Lindsay's and later Lindsay's Target) is a mid-price department store chain owned by Wesfarmers. It is Australia's largest department store chain by store number, operating 308 stores throughout the country (183 Target stores and 125 Target Country). Products it sells include branded clothing, cosmetics, homewares, electrical, fitness and consumer electronics. The company's national support office is currently located in North Geelong, Victoria but will move its headquarters to Williams Landing at the end of 2018.", 'title': 'Target Australia'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Future Shop was a Canadian electronics store chain. It was established in 1982 by Hassan Khosrowshahi. By 1990, the chain had become the country's largest retailer of computer and consumer electronics. In January 2013, the company operated 139 locations across Canada.", 'title': 'Future Shop'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Festival Foods is a family owned grocery store chain based in Minnesota (not to be confused with the Wisconsin store chain) and operates six stores in the Twin Cities. Festival Foods is owned and operated by sisters, Marie Aarthun and Lauri Youngquist. Their stores are located in Andover, Bloomington, Brooklyn Park, Hugo, Lexington and White Bear Lake. The stores in Andover and Hugo feature Dunn Bros in-store coffee houses that roast their beans fresh on-site. The chain also contains other special in-store offerings, such as a full selection liquor store in Hugo and a café at the Bloomington Location. Festival Foods stores were previously located in Vadnais Heights and Virginia, Minnesota.', 'title': 'Festival Foods (Minnesota)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'X-cite by Alghanim Electronics (part of Alghanim Industries) is an electronics store currently based in Kuwait. Their product line includes computers & tablets, mobile phones, cameras, TVs, audio & MP3, games & toys, major appliances, small housewares, watches, fitness gear, and home furnishing.', 'title': 'X-cite by Alghanim Electronics'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Fred Meyer, Inc., is a chain of superstores founded in 1922 in Portland, Oregon, by Fred G. Meyer (not to be confused with Frederik Gerhard Hendrik Meijer, former chairman of the Meijer superstore chain, which is based in Michigan, with stores in the Midwest). The company was one of the pioneers of one-stop shopping, eventually combining a complete grocery supermarket with a drugstore, clothing store, shoe store, fine jewelers, home decor store, home improvement center, garden center, electronics store, toy store, sporting goods store, and more under one roof.', 'title': 'Fred Meyer'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Times Square Stores (also called TSS and TSS Seedman\'s) was an American department store chain based in New York City that operated from 1929 to 1989. By the late 1980s the chain operated 12 stores in New York and 6 in Puerto Rico, and an off-price ladies\' apparel chain, "Finders Keepers", which had 15 locations. The New York department stores ranged in size from 160,000 to 220000 sqft . During its prime it was considered Long Island\'s most prominent discount department store chain.', 'title': 'Times Square Stores'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Driven To Perform (DTP) is an auto show billed as Western Canada's largest and most established automotive lifestyles tour and originally featured mainly import tuner sport compact cars. The inaugural show was held in Vancouver, BC in 2002 as Import Showoff Canada, but has since changed its name and expanded to include other vehicle types and into the other large metropolitan cities in this region of Canada. Major sponsors include Toyo Tires, Future Shop, Mobil1, Honda, Mazda, Lordco and Visions Electronics.", 'title': 'Driven To Perform'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Jim Westwood was the chief engineer at Sinclair Research Ltd in the 1980s, starting at the company in 1963. Westwood was the technical mastermind behind many of Sinclair's products and worked there for more than twenty years. Sir Clive Sinclair and Westwood shared a connection even before they met when Westwood had previously worked at an electronics store in London which was owned by Bernard Babani, Sinclair's publisher. This gave Westwood a good degree of familiarity with Sinclair's designs, which prompted him to join Sinclair's fledgling company, Sinclair Radionics. Westwood subsequently had a hand in most of the company's products, including the calculators, audio equipment, ZX Spectrum computers and TV80. He is still designing hardware for Amino Communications, and is a partner in Cambridge Electronics Consultancy.", 'title': 'Jim Westwood'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Nguyenkim Shopping Center (also known as "Nguyenkim Electronic Appliance Center") is the largest electronics shopping center (one-stop shop) in Ho Chi Minh City that sells household appliances, refrigerations, computers, recreational, and telecommunications products from world famous brands such as Sony, Panasonic, Toshiba, Philips, JVC, Sanyo, Sharp, Samsung, LG, Electrolux, HP, IBM, etc. It was established as a small electronics store by Nguyen Van Kim in 1992 and has been developed since then.', 'title': 'Nguyenkim Shopping Center'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'L&F Jones Holdings Ltd is a company based in Westfield, Somerset, England, that includes a convenience store chain, a wholesale food business, and a Best Western PLUS hotel. The store chain comprises twelve shops in Somerset, Wiltshire, Dorset, South Gloucestershire, and Bristol.', 'title': 'L&amp;F Jones'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Floater is an American rock band currently based in Portland, Oregon. The band was started in 1993 by Robert Wynia, Peter Cornett and David Amador. They are known for their progressive concept albums, stylized storytelling, intense live performances, and devoted fanbase. Floater routinely sells out local venues in Oregon and periodically plays shows in the neighboring states of Washington, California, Nevada, and Idaho. Floater has played a variety of venues, including CBGB in New York and the Roxy Theatre in Los Angeles. The band was also a musical guest for Live Wire Radio on OPB radio. The band has been voted the "Best Band" in the Willamette Week\'s "Best of Portland" reader\'s poll for 2009 and 2010.', 'title': 'Floater (band)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Live Wire: Woody Guthrie in Performance 1949 is a recording of a concert by Woody Guthrie in Newark, New Jersey, one of a small number of surviving live recordings of the folk singer. The program consists of Guthrie answering questions from his wife Marjorie about his life, and singing songs. The recording was made on an inexpensive wire recorder by Paul Braverman, and a significant restoration process was required to clean up the audio on the two spools of wire. In 2008 the album won a Grammy Award for Best Historical Album.', 'title': 'The Live Wire: Woody Guthrie in Performance 1949'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Luke Burbank (born May 8, 1976) is an American radio host and podcaster who hosts the Portland, Oregon-based syndicated variety show "Live Wire Radio" and the Seattle-based former radio program and current podcast "Too Beautiful to Live". He was most recently co-host of "The Ross and Burbank Show" and host of "The Luke Burbank Show" on Seattle\'s KIRO-FM radio station. Burbank is also a correspondent for CBS News Sunday Morning.', 'title': 'Luke Burbank'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"Live Wire" is a 1964 dance single released by Motown girl group Martha and the Vandellas. The song was produced by Holland–Dozier–Holland under the same gospel-pop confection of their earlier hit singles "(Love Is Like a) Heat Wave" and "Quicksand". The song explained why the narrator can\'t come up with words to tell her lover that she was through with him because when she looks at him, she feels that he is "like a bolt of lightning" and that he\'s a "live wire". The song failed to hit the Top 40 of the pop chart (peaking at #42) and reached #11 on Cashbox\'s R&B singles chart (the "Billboard" R&B chart was suspended until January 1965).', 'title': 'Live Wire (Martha and the Vandellas song)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Desde Gayola was a Mexican late-night live television sketch comedy and variety show created by Horacio Villalobos. The show premiered on the music video network Telehit in February 2002 as a sketch into the variety show "Válvula de Escape". The show revolves around a series of parodies about Mexican culture, sexuality and politics, performed by a large and varying cast of repertory and newer cast members.', 'title': 'Desde Gayola'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Too Beautiful to Live (often abbreviated to TBTL) is a podcast originating from Seattle, Washington and Bellingham, Washington (the Bay City), co-hosted by Luke Burbank, CBS News Sunday Morning correspondent, host of Live Wire Radio and frequent NPR's Wait Wait...Don't Tell Me! panelist, and veteran radio producer and one time radio host Andrew Walsh. The podcast originated as a radio show on KIRO-FM which aired from January 7, 2008 to September 11, 2009. Upon its radio broadcast cancellation, it immediately transitioned to a podcast on September 14, 2009, and is still produced Monday through Friday.", 'title': 'Too Beautiful to Live'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Livewire(s), Live Wire(s), The Live Wire or Live Wired may refer to:', 'title': 'Livewire'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Live Wire Radio is a radio variety show that was launched in 2004 in Portland, Oregon. Staff at the upstart, weekly show are hoping to position it to possibly be considered by American Public Media as a replacement for Garrison Keillor\'s "A Prairie Home Companion".', 'title': 'Live Wire Radio'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'A Prairie Home Companion is a live weekly radio variety show hosted by musician and songwriter Chris Thile. The program was created in 1974 by Garrison Keillor, who hosted it until 2016. It airs on Saturdays from 5 to 7 p.m. Central Time, from the Fitzgerald Theater in Saint Paul, Minnesota; it is also frequently heard on tours to New York City and other US cities. The show is known for its musical guests, especially folk and traditional musicians, tongue-in-cheek radio drama, and relaxed humor. Keillor\'s wry storytelling segment, "News from Lake Wobegon", was the show\'s best-known feature during his long tenure.', 'title': 'A Prairie Home Companion'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Live Wire is a 2004 live CD/DVD released by Christian rock band Third Day. All of the tracks, except for "Sing a Song" and "Blackbird", are from their album "Wire", released earlier that year. "Thank You All" was recorded especially for "Live Wire". Some of the songs were cut off the CD but can be found on the DVD. The concert was shot and recorded in Louisville, Kentucky, at the Palace Theater. It has been certified Platinum by the RIAA.', 'title': 'Live Wire (album)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The Rochdale Society of Equitable Pioneers, founded in 1844, was an early consumer co-operative, and one of the first to pay a patronage dividend, forming the basis for the modern co-operative movement.', 'title': 'Rochdale Society of Equitable Pioneers'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Moulton Co-operative Society Limited, or simply Moulton Co-op, was a small regional consumer co-operative in the United Kingdom. The society was formed in 1861 and operated a single supermarket in Moulton, Northamptonshire. In January 2009, members voted overwhelmingly to transfer arrangements to Midlands Co-operative Society, which took effect on 8 February 2009.', 'title': 'Moulton Co-operative Society'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Co-operative Group, trading as The Co-op, is a British consumer co-operative with a diverse family of retail businesses including food retail; electrical retail; financial services; insurance services; legal services and funeralcare, with in excess of 4,200 locations. It is the largest consumer co-operative in the UK and owned by more than 4 million active members. Membership is open to everyone aged 16 and over in the society, provided they agree to subscribe £1 sterling in the capital of the society out of their first share of the profits and share the values & principles upon which the group was founded. Members are democratically involved in setting business strategy, decide how social goals are achieved, and share in its profits - in the 2016 £19m was returned to members and their chosen local community causes via the 5+1 scheme. No year end dividend was paid in 2015.', 'title': 'The Co-operative Group'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Anglia Regional Co-operative Society Limited was the fifth largest consumer co-operative in the United Kingdom. It was formed by the merger of the Greater Peterborough Regional and Anglia (formerly Waveney) co-operative societies in 1987. The Society had a wide-ranging and extensive portfolio with over 80 stores, principally trading in East Anglia. Head office was located at Westgate House, Peterborough until 2011.', 'title': 'Anglia Regional Co-operative Society'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Up There is a 2012 British feature film comedy-drama, written and directed by Scottish-based film-maker Zam Salim. It stars Burn Gorman, Kate O'Flynn, Aymen Hamdouchi, Chris Waitt, Jo Hartley and Warren Brown. It is financed by the UK Film Council, BBC and Creative Scotland. It is based on Zam Salim's award-winning short film 'Laid Off' which has over half a million hits on YouTube. 'Up There' received its World Premiere at the International Film Festival of Mannheim-Heidelberg on 18 November 2011. It won the award for Best Feature Film at the 2012 British Academy Scotland Awards, and was broadcast on BBC Two in August 2015.", 'title': 'Up There'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'An Honest Liar is a 2014 biographical feature film documentary, directed and produced by Justin Weinstein and Tyler Measom, written by Weinstein, Greg O\'Toole and Measom, produced through Left Turn Films, Pure Mutt Productions and Part2 Filmworks, and distributed by Abramorama. It was pitched at the 2012 Sheffield Doc/Fest MeetMarket. The film documents the life of former magician, escape artist, and skeptical educator James Randi, in particular the investigations through which Randi publicly exposed psychics, faith healers, and con-artists. The film also focuses on Randi\'s relationship with his partner of 25 years, José Alvarez, who at the time of filming, had been discovered to be living under a false identity, calling into question "whether Randi was the deceiver or the deceived."', 'title': 'An Honest Liar'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Penrith Co-operative Society Limited, known locally as Penrith Co-op, was a small regional consumer co-operative in the United Kingdom. The society was formed in 1890 and at the time of its merger with Scotmid it operated one department store with supermarket attached and eight small supermarkets or convenience stores in Cumbria and County Durham.', 'title': 'Penrith Co-operative Society'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Phone Co-op, is a consumer co-operative in the United Kingdom, which provides fixed, mobile telephone and internet services, including web hosting and broadband. It is 100% owned by its customer-members who democratically control the business and who share in its profits. This makes The Phone Co-op the only telephone co-operative in the UK. The co-op is a Social enterprise and was awarded the title of UK customer-facing social enterprise of the year 2015. The business is a living wage employer and is accredited to hold the "Fair Tax Mark".', 'title': 'The Phone Co-op'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Woodlands Farm Trust is a registered charity that administers the 89-acre Woodlands Urban Farm on the SE fringes of Inner London. The farm was saved by the community from development by house builders in a successful local campaign stretching from 1995 to 1997. It was previously threatened by the Greater London Council plan for the East London river crossing and road scheme which crossed the land and was planned to run through the adjacent ancient forest. The Farm Land is owned by The Co-operative Group a UK consumer co-operative society, but leased to the charity on a 999-year lease at peppercorn rent. The farm is located on Shooter's Hill, Greenwich, situated a vein of protected Metropolitan Open strectching from Eltham to Plumstead and Welling in South East London, across Shooter's Hill (A207 road) from Oxleas Wood and located next to the new London Olympic Legacy Horse Riding College.", 'title': 'Woodlands Farm Trust'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The Rochdale Pioneers is a British biographical feature film, released in 2012, that tells the story of the foundation of the first successful cooperative retail store by working class members of the Rochdale Society of Equitable Pioneers, in 1844. This came at a time of chronic unemployment, poverty, hunger and social inequality, and it was met with prejudice and opposition.', 'title': 'The Rochdale Pioneers'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Richard Lee Stansbury (born December 23, 1959), is an American college basketball and the current head coach of the Western Kentucky University basketball team. He was previously the head coach at Mississippi State. He was hired as the WKU head coach on March 28, 2016. He is a member of the Campbellsville University Athletics Hall of Fame.', 'title': 'Rick Stansbury'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'William "Bill" Matthew Strannigan (December 1, 1918 – September 7, 1997) was a college men\'s basketball coach . He was the head coach of Colorado State from 1950 to 1954, Iowa State from 1954 to 1959, and Wyoming from 1959 to 1973. He coached his teams to a 308-289 record, winning one Mountain States Conference championship, two Western Athletic Conference championships, two NCAA tournament appearances, and two NIT appearances. He played his college basketball at Wyoming. He was inducted into the Wyoming athletics Hall of Fame in 1994 and the Iowa State athletics Hall of Fame in 2005.', 'title': 'Bill Strannigan'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Osborne Bryan Cowles (August 25, 1899 – August 29, 1997) was an American basketball player and coach. He was the head men\'s basketball coach at Carleton College (1924–1930), River Falls State Teachers College (now University of Wisconsin–River Falls) (1932–1936), Dartmouth College (1936–1946), University of Michigan (1946–1948), and University of Minnesota (1948–1959). He was also the head baseball coach and assistant basketball and football coach at Iowa State Teachers College, now the University of Northern Iowa during 1923–24. In 30 seasons as a collegiate head basketball coach, Cowles compiled a record of 416–189 ( ). His teams competed in the NCAA basketball tournament six times. At the time of his retirement in 1959, Cowles ranked among the top 15 college basketball coaches of all-time by number of games won. He has been inducted into the Helms Foundation Hall of Fame, the Dartmouth "Wearers of the Green," the University of Minnesota "M" Club Hall of Fame, the Carleton College Hall of Fame, and the University of Wisconsin-River Falls Athletics Hall of Fame.', 'title': 'Osborne Cowles'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Kermit Blosser Ohio Athletics Hall of Fame is the shrine which all Ohio University Bobcats greats aspire to enter. Since 1965, inductees to the Blosser Ohio Athletics Hall of Fame are inducted during banquet ceremonies the evening prior to a designated home football game. Inductees are also recognized during a special halftime ceremony at the football game the following day. Inductees are also honored into perpetuity as their portrait and accomplishments are displayed in the Ohio Athletics Hall of Fame currently located in the Convocation Center.', 'title': 'Kermit Blosser Ohio Athletics Hall of Fame'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Ken Hayes (born 1931) was the head men's basketball coach at Tulsa (1968–75), New Mexico State (1975–79), Oral Roberts (1979–82) and Northeastern State (1983–97). Hayes was inducted into the Tulsa University Athletics Hall of Fame (2008), the Northeastern State Athletics Hall of Fame (1999), and the Bacone College Athletics Hall of Fame (2013).", 'title': 'Ken Hayes'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Harry Junior "The Horse" Gallatin (April 26, 1927 – October 7, 2015) was an American professional basketball player and coach. Gallatin played nine seasons for the New York Knicks in the NBA from 1948 to 1957, as well as one season with the Detroit Pistons in the 1957–58 season. Gallatin led the NBA in rebounding and was named to the All-NBA First Team in 1954. The following year, he was named to the All-NBA Second Team. For his career, Gallatin played in seven NBA All-Star Games. A member of the Naismith Memorial Basketball Hall of Fame, he is also a member of the National Collegiate Basketball Hall of Fame, the SIU Edwardsville Athletics Hall of Fame, the Truman State University Athletics Hall of Fame, the Missouri Sports Hall of Fame, two Illinois Basketball Halls of Fame, the Mid-America Intercollegiate Athletics Association (MIAA) Hall of Fame, the National Association of Intercollegiate Athletics (NAIA) Hall of Fame, and the SIU Salukis Hall of Fame.', 'title': 'Harry Gallatin'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Richard Williams was the college basketball head coach at Mississippi State from 1986 to 1998. He is the 2nd most successful coach in school history with 191 victories (191–163 .540) bested only by his former assistant, Rick Stansbury. His 1991 squad won the Southeastern Conference championship and made the NCAA tournament losing in the first round to Eastern Michigan. His 1995 squad made the Sweet Sixteen, and his 1996 squad made the school's only Final Four appearance losing to Syracuse 77–69. He received two SEC Coach of the Year awards. Richard Williams resigned as the head coach at MSU two years removed from his Final Four appearance. After leaving MSU, he coached the Memphis Houn'Dawgs of the ABA and the Jackson Rage of the WBA. and coached for a time at his alma mater, Pearl High School. He served as the Director of Basketball Administration at UAB in 2008 and in 2009 he was named the Director of Basketball Administration and Program Coordinator for the Louisiana Tech men’s basketball team on a volunteer basis.", 'title': 'Richard Williams (basketball coach)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Lester Joseph Lautenschlaeger (May 27, 1904 – August 5, 1986) was an American football player and coach and politician. He played at the quarterback position at Tulane University from 1922 to 1925, served as an assistant football coach at Tulane from 1929 to 1935, and served in the Louisiana House of Representatives from 1928 to 1932. He was inducted to the College Football Hall of Fame in 1975, the Tulane Athletics Hall of Fame in 1977, and the Louisiana Sports Hall of Fame in 1983.', 'title': 'Lester Lautenschlaeger'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'James Harrel "Speedy" Speer (March 5, 1895 – September 2, 1976) was a college football player for the Furman Paladins of Furman University and a high school football coach. He was elected to the South Carolina Athletics Hall of Fame in 1974, and the Furman Athletics Hall of Fame in 1981.', 'title': 'Speedy Speer'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'David William Rankin (February 2, 1919 – December 8, 2006) was an American football player and track athlete and coach. He was a consensus first-team All-American at the end position at Purdue University in 1940. He also set a U.S. indoor record in the 60-yard low hurdles in 1940. During World War II, he served as a fighter pilot in the United States Marine Corps. He later worked as the head coach of the Purdue track team from 1946 to 1981. He was also an assistant football coach at Purdue in 1947 and 1948. He was also the U.S. track team coach at the 1975 World University Games. He has been inducted into the Purdue Intercollegiate Athletics Hall of Fame (1998), the Indiana Football Hall of Fame (1977) and the Drake Relays Coaches Hall of Fame (1995). Rankin died in 2006 at the age of 87.', 'title': 'David Rankin (American football)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Beaufort (English translation of "אם יש גן עדן"; in Hebrew: If There\'s a Heaven) is the first novel by Israeli author and media professional Ron Leshem. The work was initially published in 2005 and in English translation under this title in 2007. The novel was the basis for the 2007 Academy Award-nominated film "Beaufort".', 'title': 'Beaufort (novel)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Four is a 2012 Chinese-Hong Kong "wuxia" film directed by Gordon Chan and Janet Chun. It is the first film adaptation of Woon Swee Oan\'s novel series "Si Da Ming Bu" (四大名捕; "The Four Great Constables"), which has previously been adapted to a television series. In all adaptations and interpretations, the nicknames of the Four remained the same — Emotionless, Iron Hands, Life Snatcher and Cold Blood. They dedicated their special skills to the service of their chief, Master Zhuge, in solving crimes and apprehending powerful criminals.', 'title': 'The Four (film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The 13⁄ Lives of Captain Bluebear is a 1999 fantasy novel by German writer and cartoonist Walter Moers which details the numerous lives of a human-sized bear with blue fur. The captain\'s name is originally a pun in German, based upon the fact that the German words for "bears" ("Bären") and "berries" (Beeren) sound very much alike, whereas "Blaubeere" (lit. "blueberry") is actually the German word for bilberry (a number of other German cartoonists have made similar puns relating to bear names in their stories, including Rötger Feldmann aka Brösel), that a typical sailorish sailor is called an (old) "seabear", and that sailors are prejudiced to be quite often "blue", i.e. drunk. The novel was originally written in German, an English translation was published in the United Kingdom in 2000 and in the United States in 2005, an Italian translation in 2000, a Chinese translation in 2002, and a French translation in 2005. The novel attained considerable popularity in Germany and the United Kingdom while experiencing relative obscurity in the United States.', 'title': 'The 13½ Lives of Captain Bluebear'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The Four III (Chinese: 四大名捕3) is a Chinese-Hong Kong 3D wuxia film directed by Gordon Chan and Janet Chun. It is the final installment of the trilogy based on Woon Swee Oan\'s novel series, after "The Four" (2012) and "The Four II" (2013).', 'title': 'The Four III'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Log Horizon (Japanese: ログ・ホライズン , Hepburn: Rogu Horaizun ) is a Japanese novel series written by Mamare Touno and illustrated by Kazuhiro Hara, published by Enterbrain in Japan since 2011. Yen Press began publishing the novels in English translation in 2015. The series follows the strategist, Shiroe, and the other players of the long-lived MMORPG "Elder Tales" after they find themselves whisked away into the game world following a game update. The novel has received four manga adaptations, with one based on the main story and the other three revolving around characters in the series. An anime adaptation aired on NHK Educational TV between October 5, 2013 and March 22, 2014. A second season aired between October 4, 2014 and March 28, 2015.', 'title': 'Log Horizon'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Tanya Grotter (Russian: Таня Гроттер ) is the female protagonist of a Russian fantasy novel series by Dmitri Yemets. Tanya (short for Tatiana) Grotter is an orphan with intentional resemblances to J. K. Rowling\'s "Harry Potter". Despite its reputation in Russia and the many books it has spawned, the series is not available in English translation, because of the first book having been judged a breach of copyright.', 'title': 'Tanya Grotter'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Scream, the debut English album by German band Tokio Hotel, contains English versions of songs from two of their previous albums: "Schrei" and "Zimmer 483". Eight of the twelve songs come from "Zimmer 483" while the remaining four originated from "Schrei". The name "Scream" is the English translation of the name of the first Tokio Hotel album, "Schrei". In German-speaking countries, the album was released as "Room 483" - the English translation of their second album\'s name ("Zimmer 483"). The first single released from the album was simply called "Monsoon" - not "Through the Monsoon" (the literal translation of the original, "Durch den Monsun").', 'title': 'Scream (Tokio Hotel album)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'John Ormsby (1829–1895) was a nineteenth-century British translator. He is most famous for his 1885 English translation of Miguel de Cervantes\' "Don Quixote de la Mancha", perhaps the most scholarly and accurate English translation of the novel up to that time. It is so precise that Samuel Putnam, who published his own English translation of the novel in 1949, faults Ormsby for duplicating Cervantes\' pronouns so closely that the meaning of the sentences sometimes becomes confusing.', 'title': 'John Ormsby (translator)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Despair (Russian: "Отчаяние" , or "Otchayanie ") is the seventh novel by Vladimir Nabokov, originally published in Russian, serially in the politicized literary journal "Sovremennye zapiski" during 1934. It was then published as a book in 1936, and translated to English by the author in 1937. Most copies of the 1937 English edition were destroyed by German bombs during World War II; only a few copies remain. Nabokov published a second English translation in 1965; this is now the only English translation in print.', 'title': 'Despair (novel)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Gerbrand Bakker (born 28 April 1962) is a Dutch writer. He won the International IMPAC Dublin Literary Award for "The Twin", the English translation of his novel "Boven is het stil", and the Independent Foreign Fiction Prize for "The Detour", the English translation of his novel "De omweg".', 'title': 'Gerbrand Bakker (novelist)'}]

