 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Rani Mukerji is an Indian actress known for her work in Bollywood films. She made her screen debut with a supporting role in "Biyer Phool" (1996), a Bengali film directed by her father Ram Mukherjee. Her first leading role was that of a rape victim in the 1997 social drama "Raja Ki Aayegi Baraat", for which she won a special jury trophy at the Screen Awards ceremony. In 1998 she received wider recognition for her role alongside Aamir Khan in the action film "Ghulam". Later that year, her breakthrough role as the romantic interest of Shah Rukh Khan\'s character in the romantic drama "Kuch Kuch Hota Hai" earned Mukerji her first Filmfare Award in the Best Supporting Actress category. She followed this initial success by portraying the leading lady in several films, including the comedy film "Hello Brother" (1999) and the drama "" (2001), none of which helped propel her career forward.', 'title': 'Rani Mukerji filmography'}
