[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Bells from the Deep: Faith and Superstition in Russia, is a 1993 documentary film written and directed by Werner Herzog, produced by Werner Herzog Filmproduktion.', 'title': 'Bells from the Deep'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'La Soufrière – Warten auf eine unausweichliche Katastrophe ("La Soufrière – Waiting for an Inevitable Disaster") is a 1977 West German documentary film in which German director Werner Herzog visits an island on which a volcano is predicted to erupt. The pretext of this film was provided when Herzog "heard about the impending volcanic eruption, that the island of Guadeloupe had been evacuated and that one peasant had refused to leave, [he] knew [he] wanted to go talk to him and find out what kind of relationship towards death he had" (Cronin). Herzog explores the deserted streets of the towns on the island. The crew of three treks up to the caldera, where clouds of sulfurous steam and smoke shift drift like "harbingers of death" (Peucker), an example of the sublime Herzog seeks to conjure in his films. Herzog converses in French with three different men he finds remaining on the island: one says he is waiting for death, and demonstrates his posture for doing so; another says he has stayed to look after the animals. In the end, the volcano did not erupt, thus sparing the lives of those who had remained on the island, including Herzog and his crew.', 'title': 'La Soufrière (film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Lucki Stipetić (also Lucki Herzog) is a German film producer, and the younger half brother of filmmaker Werner Herzog. Stipetić is the official head of Werner Herzog Filmproduktion, the production company which has produced almost all of Herzog's films.", 'title': 'Lucki Stipetić'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Portrait Werner Herzog (German: Werner Herzog - Filmemacher ) is an autobiographical short film by Werner Herzog made in 1986. Herzog tells stories about his life and career.', 'title': 'Portrait Werner Herzog'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Requiem for a Dying Planet (subtitled Sounds for Two Films by Werner Herzog is an album by cellist Ernst Reijseger featuring music for Werner Herzog\'s 2004 documentary "The White Diamond" and 2005 film "The Wild Blue Yonder" performed with vocalist/poet/performer Mola Sylla and the Voches de Sardinna. The original tracks were recorded in 2004 in France and Germany and additional recording undertaken in Germany in 2006 before the album was released on the Winter & Winter label.', 'title': 'Requiem for a Dying Planet'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Happy People: A Year in the Taiga is a 2010 documentary film directed by Werner Herzog and Dmitry Vasyukov and produced by Herzog. The film depicts the life of the people in the village of Bakhta ( ) along the Yenisei River in the Siberian taiga. In particular, it focuses on the trappers who hunt for fur animals, such as sable. It also briefly detours to a look at the life of native Ket people. The footage in the documentary was edited from a previous television work by Vasuykov, with original production and voiceovers by Herzog.', 'title': 'Happy People: A Year in the Taiga'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'How Much Wood Would a Woodchuck Chuck (German: Beobachtungen zu einer neuen Sprache, literally "Observations of a New Language") is a 1976 documentary film by German director Werner Herzog, produced by Werner Herzog Filmproduktion. It is a 44-minute film documenting the World Livestock Auctioneer Championship held in New Holland, Pennsylvania. Herzog has said that he believes auctioneering to be "the last poetry possible, the poetry of capitalism." Herzog describes the auctioneering as an "extreme language ... frightening but quite beautiful at the same time."', 'title': 'How Much Wood Would a Woodchuck Chuck (film)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Werner Herzog Eats His Shoe is a short documentary film directed by Les Blank in 1980 which depicts director Werner Herzog living up to his promise that he would eat his shoe if Errol Morris ever completed the film "Gates of Heaven". The film includes clips from both "Gates of Heaven" and Herzog\'s 1970 feature "Even Dwarfs Started Small". Comic song "Old Whisky Shoes", played by the Walt Solek Band, is the signature tune over the opening and closing credits.', 'title': 'Werner Herzog Eats His Shoe'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Little Dieter Needs to Fly is a 1997 German-British-French documentary film written and directed by Werner Herzog, produced by Werner Herzog Filmproduktion, and premiered on German television. The film was released to DVD in 1998 by Anchor Bay.', 'title': 'Little Dieter Needs to Fly'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Life After People is a television series on which scientists, structural engineers, and other experts speculate about what might become of Earth should humanity instantly disappear. The featured experts also talk about the impact of human absence on the environment and the vestiges of civilization thus left behind. The series was preceded by a two-hour special that aired on January 21, 2008 on the History Channel which served as a de facto pilot for the series that premiered April 21, 2009. The documentary and subsequent series were both narrated by James Lurie.', 'title': 'Life After People'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Amy Farina is a musician living in Washington, D.C. As of 2001, Farina has played drums and sings in the Indie rock duo The Evens which includes her husband Ian MacKaye. Previously she has played in The Warmers (which included Ian's younger brother Alec MacKaye), Mister Candy Eater, Ted Leo & the Pharmacists and with Lois Maffeo. She and MacKaye welcomed their first child, Carmine Francis Farina MacKaye, on May 24, 2008. She is the sister of Geoff Farina of the band Karate.", 'title': 'Amy Farina'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"Zip Gun Boogie" is a 1974 single, originally credited in the UK as a solo single by Marc Bolan of the British glam rock band T. Rex. In other territories, the single was credited to "T. Rex" or "Marc Bolan and T. Rex"; almost all reissues of the track credit it solely to T. Rex. The track and its B-side feature on the 1975 T. Rex album Bolan\'s Zip Gun.', 'title': 'Zip Gun Boogie'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Life Time is the first full-length studio album by Rollins Band, fronted by ex-Black Flag singer, Henry Rollins. The album was produced by Ian MacKaye, well known in the genre of hardcore punk for his work with Minor Threat and as co-owner of the Dischord record label. MacKaye was also a childhood friend of Rollins, who acted as a roadie for MacKaye\'s band The Teen Idles. It was originally released in 1987 and included four live tracks recorded in Kortrijk, Belgium in October 1987. It was subsequently re-mastered and re-released in 1999 without the live tracks, but with the addition of three session tracks from the "Do It" album of 1987. The 2014 reissue on Dischord includes the live tracks but not the bonus tracks included on the 1999 reissue .', 'title': 'Life Time (Rollins Band album)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Billy Super Duper is an album by English glam rock act T. Rex. Released in 1982 by record label Marc on Wax, it was the first LP of entirely new and unheard material released after Marc Bolan\'s death in 1977 as the previous posthumous release, "You Scare Me to Death" consisted of demos first released in 1974. Billy Super Duper consists of studio outtakes and home demos recorded by the band between 1972 and 1977, with arrangements produced by John and Shan Bramley (the heads of the Marc Bolan Fanclub at the time). The album was intended to "complete" the demos and bring them up to date with contemporary music.', 'title': 'Billy Super Duper'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Rozzlyn Rangers was the name taken by the 5 original members of the Dischord House in Arlington, Virginia (fairly near Rosslyn, Virginia) in October 1981: Ian MacKaye, Jeff Nelson, Rich Moore, Eddie Janney, and Sab Grey. Dischord House housed Dischord Records (founded a year earlier by The Teen Idles, shortly thereafter to be run by Ian MacKaye and Jeff Nelson). Despite its terribly low ceiling, many DC punk bands practiced in its basement over the years: Minor Threat, Skewbald, Iron Cross, The Faith, Second Wind, Rites of Spring, Embrace, Three, Fugazi, Beefeater, Fidelity Jones, Happy Go Licky, Kingface, One Last Wish, The Evens.', 'title': 'Rozzlyn Rangers'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Marc Bolan ( ; born Mark Feld; 30 September 1947\xa0– 16 September 1977) was an English singer-songwriter, musician, guitarist, and poet. He was best known as the lead singer of the glam rock band T. Rex. Bolan was one of the pioneers of the glam rock movement of the 1970s. He died at age 29 in a car accident a fortnight before his 30th birthday.', 'title': 'Marc Bolan'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Windstorm is the fourth studio album released by Gloria Jones in 1978. This album was a dedication to Marc Bolan, as on the rear cover, is written: "Special Dedication in memory of my son\'s father, the late Marc Bolan, whom we miss very much."', 'title': 'Windstorm (album)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Paul Fenton (born 4 July 1946 in Huddersfield, Yorkshire, England) is an English drummer, best known for his work with T. Rex. After leaving Christie, he started playing drums for T. Rex in 1973, after being recommended to Marc Bolan by his producer Tony Visconti. He also toured briefly with Marc Bolan & T. Rex in 1974, and played additional drums with Davy Lutton on the songs "Solid Baby", "Funky London Childhood", and "Visions Of Domino".', 'title': 'Paul Fenton (musician)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Evens are a Washington, D.C. indie-rock duo, formed in the fall of 2001, comprising partners Ian MacKaye (guitars, vocals) (of Fugazi, formerly of Minor Threat) and Amy Farina (drums, vocals) (formerly of The Warmers). After Ian MacKaye\'s band Fugazi entered a hiatus, The Evens began practicing extensively, and eventually played a few shows and recorded a self-titled album, released in March 2005 on MacKaye\'s label, Dischord Records. The Evens are known for their unusual choices in venues for performances and the stylistic change from what many have dubbed the "D.C." or "Dischord" sound. " The Washington Post" has described the sound as "what happens when post-hardcore becomes post-post-hardcore."', 'title': 'The Evens'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Ian Thomas Garner MacKaye ( ; born April 16, 1962) is an American singer, songwriter, guitarist, musician, record label owner and producer. Active since 1979, MacKaye is best known as the co-founder and owner of Dischord Records, a Washington, D.C.-based independent record label and the frontman of the influential hardcore punk band Minor Threat and the post-hardcore band Fugazi. MacKaye was also the frontman for the short-lived bands The Teen Idles, Embrace and Pailhead, a collaboration with the band Ministry. MacKaye is a member of The Evens, a two-piece indie rock group he formed with his wife Amy Farina in 2001.', 'title': 'Ian MacKaye'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Forbes ( ) is an American business magazine. Published bi-weekly, it features original articles on finance, industry, investing, and marketing topics. "Forbes" also reports on related subjects such as technology, communications, science, politics, and law. Its headquarters is located in Jersey City, New Jersey. Primary competitors in the national business magazine category include "Fortune" and "Bloomberg Businessweek". The magazine is well known for its lists and rankings, including its lists of the richest Americans (the Forbes 400) and rankings of world\'s top companies (the Forbes Global 2000). Another well-known list by the magazine is The World\'s Billionaires list.', 'title': 'Forbes'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Schreiber Foods Inc., is a dairy company which produces and distributes natural cheese, processed cheese, cream cheese and yogurt. It is an employee-owned customer brand dairy company headquartered in Green Bay, Wisconsin. With more than $5 billion in annual sales, Forbes ranked Schreiber Foods as the 81st largest private employer in 2016.', 'title': 'Schreiber Foods'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Adelaide Morning Chronicle was a newspaper published in Adelaide, South Australia during 1852 and 1853. While claiming not to be a religious newspaper, the "Adelaide Morning Chronicle" was established by the draper Andrew Murray during the South Australian Parliament\'s debate over separation of church and state. Its intention was to provide a voice for the influential and conservative Anglican section of the Adelaide community. This was in opposition to the opinions expressed by the non-conformist churches in their newspaper, the "Austral Examiner". The newspaper was of a sufficient quality to also be seen as competition to the "South Australian Register". Murray later worked for the "Melbourne Argus". The newspaper was reduced to a bi-weekly publication (rather than daily) after 35 issues in early 1852, through the economic effects of the Victorian gold rush and ceased in early 1853.', 'title': 'Adelaide Morning Chronicle'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Port Plaza Mall (later known as Washington Commons) was an urban area shopping mall/multi-use facility located in downtown Green Bay, Wisconsin. The mall opened on August 10, 1977, and featured 3 anchor stores over the years, with JCPenney and H.C. Prange open at its launch and Boston Store added by 1982. The mall would go into a state of decline in the late 1990s and 2000s, leading up to its closure on February 27, 2006. The mall property was razed during the 1st half of 2012 as part of a redevelopment project; the headquarters of Schreiber Foods now stands on the main mall footprint.', 'title': 'Port Plaza Mall'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Port Adelaide News was a newspaper published in Port Adelaide, South Australia between 1878 and 1933 with various sub-titles, several breaks in publication and several periods of bi-weekly publication.', 'title': 'Port Adelaide News'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Cayman Islands is a group of three islands in the Caribbean Sea. The first monthly publication on the islands was "The Gospel of the Kingdom", a religious themed newspaper founded in 1945. In 1964, the newspaper "Tradewinds" began publication. This was joined by the rival "Caymanian Weekly" in 1965. This was followed by a second weekly publication, the "Cayman Compass", which started in 1972. In 1974, the two weeklies merged to form the "Caymanian Compass". This became a bi-weekly publication in 1976, appearing on Tuesdays and Fridays.', 'title': 'List of newspapers in the Cayman Islands'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Chronicle is the national newspaper of the Caribbean island nation of Dominica. It was begun by Bishop Philip Schelfhaut in 1909 as the Dominica Chronicle, a bi-weekly publication. For many years afterward, it was known as "The New Chronicle" until it dropped the "New" from its title in 1996.', 'title': 'The Chronicle (Dominica)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Massachusetts Register is the bi-weekly publication mandated by the Administrative Procedures Act (Massachusetts General Law Chapter 30A); it is an official organ of the Massachusetts state government. The Register publishes new and amended regulations; notices of hearings and comment periods related to prospective or draft regulations; and a cumulative index of regulatory changes for the current year. The Register also publishes notices of public interest, as well as opinions of the Attorney General and Executive Orders. The Register is a printed publication; online subscription is also available. This era of publication of the Massachusetts Register began in April 1976.', 'title': 'Massachusetts Register'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Our Voice Today ("OVT") is a bi-weekly publication of NYSARC, Inc. Originally published as print newsletter Our Children\'s Voice in March 1949, "OVT" has a long history of providing information and resources related to individuals with intellectual and other developmental disabilities.', 'title': 'Our Voice Today'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Fashion Calendar is an American bi-weekly publication founded by Ruth Finley in 1945, listing all fashion related events in New York City.', 'title': 'The Fashion Calendar'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'The RATE project (Radioisotopes and the Age of The Earth) was a research project conducted by the Creation Research Society and the Institute for Creation Research between 1997 and 2005 to assess the validity of radiometric dating and other dating techniques in the light of the doctrine of a recent creation. It was funded by $250,000 from the Institute for Creation Research and over $1 million in donations. The RATE team was chaired by Larry Vardiman (meteorology) and included Steven A. Austin (soft rock geology), John Baumgardner (geophysics), Steven W. Boyd (Hebrew), Eugene F. Chaffin (physics), Donald B. DeYoung (physics), Russell Humphreys (physics) and Andrew Snelling (hard rock geology).', 'title': 'RATE project'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Henry Madison Morris (October 6, 1918 – February 25, 2006) was an American young Earth creationist, Christian apologist, and engineer. He was one of the founders of the Creation Research Society and the Institute for Creation Research. He is considered by many to be "the father of modern creation science." He is widely known for coauthoring "The Genesis Flood" with John C. Whitcomb in 1961.', 'title': 'Henry M. Morris'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The TaskForceMajella (TFM) is an industry-funded geoscientific research project conducted between the years 1998 and 2005. The project involved numerous universities distributed worldwide, and was sponsored by a number of international major oil companies. The area of research was the Majella Mountain in Central Italy, regarded as an analogue of a faulted and fractured hydrocarbon reservoir as can be found in major provinces like the Middle East, Caspian Basin, Mediterranean Basin, and other areas. The scope was to obtain knowledge on the relation between fracture and fault generation, and all types of geological aspects of the evolution of the geological structure', 'title': 'TaskForceMajella'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Institute for Creation Research (ICR) is a Creationist apologetics institute in Dallas, Texas that specializes in media promotion of pseudoscientific creation science and interpretation of the Genesis creation narrative as a historical event. The ICR adopts the Bible as an inerrant and literal documentary of scientific and historical fact as well as religious and moral truths, and espouses a Young Earth creationist worldview. It rejects evolutionary biology, which it views as a corrupting moral and social influence and threat to religious belief. The ICR was formed by Henry M. Morris in 1972 following an organizational split with the Creation Science Research Center (CSRC).', 'title': 'Institute for Creation Research'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Frank Lewis Marsh (18 October 1899, Aledo, Illinois – 14 July 1992) was an American Seventh-day Adventist biologist, educator and young Earth creationist author. In 1963 he was one of the ten founding members of the Creation Research Society.', 'title': 'Frank Lewis Marsh'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Hendren et al. v. Campbell et al. was a 1977 ruling by an Indiana state superior court that the young-earth creationist textbook could not be used in Indiana public schools. Jon Hendren, a ninth-grade student in the West Clark Community Schools, sued when the district picked "Biology: A Search For Order In Complexity", published by the Creation Research Society and promoted through the Institute for Creation Research, as the sole biology textbook.', 'title': 'Hendren v. Campbell'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Creation Research Society (CRS) is a Christian research group that engages in creation science. The organization has produced various publications, including a journal and a creation-based biology textbook. During the first few years of its existence, different beliefs about Creationism and disagreement over its statement of beliefs resulted in various members of the board and voting members being forced out of the organization.', 'title': 'Creation Research Society'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Kevin R. Henke is an American geochemist and former instructor at the University of Kentucky\'s department of Geology. He currently works as a senior research scientist at the University of Kentucky\'s Center for Applied Energy Research. He is well known for his criticism of young earth creationism and the scientific arguments they make for a young earth. In particular, he has been critical of the RATE project\'s results, which claim to show that zircons contain too much helium to be billions of years old, and has argued that Russell Humphreys, a young-earth creationist who was involved in the project, has made errors in his research. These flaws include that, according to Henke, "The vast majority of Humphreys et al.\'s critical a, b, and Q/Q0 values that are used in these "dating" equations are either missing, poorly defined, improperly measured or inaccurate." Henke has also accused Humphreys of misidentifying his specimens, fudging his data, and not considering the possibility of helium contamination in this research. He has also criticized John Woodmorappe for arguing that radiometric dating is unreliable. On one occasion, Henke called Kent Hovind on the phone regarding Hovind\'s $250,000 challenge to "prove" evolution. Hovind told Henke that in order to win the money he would have to recreate the Big Bang in a laboratory. Henke responded by proposing several alternative "proofs" that pertained to geology (his field of expertise), but Hovind refused, saying that the project must be chosen by him and it must not pertain to the area in which Henke has scientific expertise. Hovind therefore required Henke to prove that dogs and bananas had a common ancestor, and lowered the award to only $2,000 should he succeed. Henke accepted the challenge, and later drafted a contract, which was then posted on Talk.origins. However, one of Henke\'s requirements was that the judges be unbiased, and Hovind rejected the challenge for this reason, insisting that he should be the only one who can choose the judges.', 'title': 'Kevin Henke'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Research comprises "creative work undertaken on a systematic basis to increase the stock of knowledge, including knowledge of humans, culture and society, and the use of this stock of knowledge to devise new applications." It is used to establish or confirm facts, reaffirm the results of previous work, solve new or existing problems, support theorems, or develop new theories. A research project may also be an expansion on past work in the field. Research projects can be used to develop further knowledge on a topic, or in the example of a school research project, they can be used to further a student\'s research prowess to prepare them for future jobs or reports. To test the validity of instruments, procedures, or experiments, research may replicate elements of prior projects or the project as a whole. The primary purposes of basic research (as opposed to applied research) are documentation, discovery, interpretation, or the research and development (R&D) of methods and systems for the advancement of human knowledge. Approaches to research depend on epistemologies, which vary considerably both within and between humanities and sciences. There are several forms of research: scientific, humanities, artistic, economic, social, business, marketing, practitioner research, life, technological, etc.', 'title': 'Research'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'MIPS (an acronym for Microprocessor without Interlocked Pipeline Stages) was a research project conducted at Stanford University between 1981 and 1984. MIPS investigated a type of instruction set architecture (ISA) now called Reduced Instruction Set Computer (RISC), its implementation as a microprocessor with very large scale integration (VLSI) semiconductor technology, and the effective exploitation of RISC architectures with optimizing compilers. MIPS, together with the IBM 801 and Berkeley RISC, are the three research projects that pioneered and popularized RISC technology in the mid-1980s. In recognition of the impact MIPS made on computing, Hennessey was awarded the IEEE John von Neumann Medal in 2000 by the IEEE (shared with David A. Patterson), the Eckert–Mauchly Award in 2001 by the Association for Computing Machinery, and the Seymour Cray Computer Engineering Award in 2001 by the IEEE Computer Society.', 'title': 'Stanford MIPS'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Charing Cross Road is a street in central London running immediately north of St Martin-in-the-Fields to St Giles Circus (the intersection with Oxford Street) and then becomes Tottenham Court Road. It is so called because it serves Charing Cross railway station (named for the nearby Charing Cross).', 'title': 'Charing Cross Road'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The North Western and Charing Cross Railway (NW&CCR) was a railway company established in 1864 to construct an underground railway in London. The NW&CCR was one of a large number of underground railway schemes proposed for London following the opening in 1863 of the Metropolitan Railway, the world's first underground railway, but was one of only a few to be authorised by Parliament. The company struggled to raise funding for the construction of its line and was twice renamed, to the Euston, St Pancras and Charing Cross Railway and the London Central Railway, before the proposals were abandoned in 1874.", 'title': 'North Western and Charing Cross Railway'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Charing Cross Music Hall was established beneath the arches of Charing Cross railway station in 1866 by brothers Giovanni and Carlo Gatti to replace the former Hungerford Hall. The site had been acquired, together with Hungerford Market, by the South Eastern Railway in 1862, and incorporated into the railway station, which opened on 11 January 1864, resulting in the demolition of the hall.', 'title': 'Charing Cross Music Hall'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'G-A-Y is a gay nightclub in London. It operated from the London Astoria music venue for 15 years until July 2008. The Boston Globe described it as "London\'s largest gay-themed club night", "NME" reported that it "attracts 6,000 clubbers each week", and "The Independent" described it as "the one London gig that really matters" for "today\'s pop stars". On Friday 3 October 2008, it moved to famous gay venue Heaven.', 'title': 'G-A-Y'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Heaven is a superclub in London, England which appeals predominantly to the gay market. It is located underneath Charing Cross railway station in Central London, just off Trafalgar Square.', 'title': 'Heaven (nightclub)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Charing Cross Complex - now styled as Elmbank Gardens (but sometimes popularly referred to as the Charing Cross Tower), is a multi-use commercial complex in the Charing Cross area of Glasgow, Scotland. Best known for its signature 14-storey tower which overlooks the M8 motorway and stands directly opposite the Mitchell Library, it was designed by Richard Seifert and constructed between 1969 and 1973. It is one of the tallest and most prominent high rise buildings on the western side of Glasgow city centre. The surface buildings of the subterranean railway station which serves Charing Cross are also an integral part of the complex.', 'title': 'Elmbank Gardens'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The Queen Eleanor Memorial Cross is a replica of the medieval Eleanor cross at Charing (London), erected in the forecourt of Charing Cross railway station in 1864–5. It was designed by Edward Middleton Barry, also the architect of the station, and includes multiple statues of Eleanor of Castile by Thomas Earp. It does not occupy the original site of the Charing Cross (destroyed in 1647), which is now occupied by Hubert Le Sueur's equestrian statue of Charles I.", 'title': 'Queen Eleanor Memorial Cross'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Charing Cross ( ) denotes the junction of Strand, Whitehall and Cockspur Street, just south of Trafalgar Square in central London. It gives its name to several landmarks, including Charing Cross railway station, one of the main London rail terminals.', 'title': 'Charing Cross'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Hungerford Market was a produce market in London, at Charing Cross on the Strand. It existed in two different buildings on the same site, the first built in 1682, the second in 1862. The market was first built on the site of Hungerford House, next to Durham Yard, the town house of the Hungerford family. The house had burned down in 1669 as is recorded in the Diary of Samuel Pepys. It was replaced by a new Italianate market building by Charles Fowler, which opened in 1833. The new market was unsuccessful. It was damaged when the adjoining Hungerford Hall burned down in 1854, and was sold to the South Eastern Railway in 1862. Charing Cross railway station was built on the site and opened in 1864.', 'title': 'Hungerford Market'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Charing Cross (sometimes informally abbreviated as Charing X) is a London Underground station at Charing Cross in the City of Westminster with entrances located in Trafalgar Square and The Strand. The station is served by the Northern and Bakerloo lines and provides an interchange with the National Rail network at Charing Cross station. On the Northern line it is between Embankment and Leicester Square stations on the Charing Cross branch, and on the Bakerloo line it is between Embankment and Piccadilly Circus stations. The station is in Travelcard Zone\xa01. The station was served by the Jubilee line between 1979 and 1999, acting as the southern terminus of the line during that period.', 'title': 'Charing Cross tube station'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Church of Scientology is a multinational network and hierarchy of numerous ostensibly independent but interconnected corporate entities and other organizations devoted to the practice, administration and dissemination of Scientology, a new religious movement. The Church of Scientology International (CSI) is officially the Church of Scientology's parent organization, and is responsible for guiding local Scientology churches. At a local level, every church is a separate corporate entity set up as a licensed franchise and has its own board of directors and executives. The first Scientology church was incorporated in December 1953 in Camden, New Jersey by L. Ron Hubbard. Its international headquarters are located at the Gold Base, in an unincorporated area of Riverside County, California. The location at Gilman Hotsprings is private property and not accessible by the public. Scientology Missions International is under CSI and oversees Scientology missions, which are local Scientology organizations smaller than churches. The Church of Spiritual Technology (CST) is the organization which owns all the copyrights of the estate of L. Ron Hubbard.", 'title': 'Church of Scientology'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Ronald S. Teachworth is an American artist, writer and film director from Rochester Hills, Michigan.', 'title': 'Ron Teachworth'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ron Stephens (born 1948) is a former Republican member of the Illinois House of Representatives, representing the 102nd district from 1985 to 1991, and from 1993 until 2011 when he announced his retirement. The district includes portions of Bond County, Madison County, Effingham County, Fayette County and St. Clair County. He was the Assistant Republican Leader in the state House until his retirement.', 'title': 'Ron Stephens (Illinois politician)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Sequoyah County Sheriff's Office is the chief law enforcement agency that serves a population of over 42,391 people in Sequoyah County, Oklahoma. In 2007, the sheriff's department became the first in the state to arrest illegal immigrants under Oklahoma's new law, the Oklahoma Taxpayer and Citizen Protection Act of 2007. In 2009, the county jail was put back into the sheriffs department. The jail was previously managed by the Sequoyah County Criminal Justice Authority. Ron Lockhart's uncle, Sam Lockhart, is a former sheriff in the county. As of 2017, Larry Lane is the current Sheriff of Sequoyah County.", 'title': "Sequoyah County Sheriff's Office (Oklahoma)"}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Paulville, Texas, is an American cooperative organization as well as the site and planned community under its development in the salt flats of north Hudspeth County, intended to consist exclusively of Ron Paul supporters. The Paulville community idea was named after U.S. Congressman and 2012 presidential candidate Ron Paul, and the cooperative is modeled on his often libertarian ideas. " The New York Times" says, "For now, the town is little more than an idea and a title deed," but considers it to be evidence that Paul\'s "campaign appears to be growing into something beyond a conventional protest campaign," also echoing the concept expressed by others that "the Ron Paul revolution has increasingly less to do with Ron Paul".', 'title': 'Paulville'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Going Back is a 1983 American independent drama film written and directed by Ron Teachworth and starring Bruce Campbell and Christopher Howe. It was Campbell\'s second feature film, produced shortly after "The Evil Dead".', 'title': 'Going Back (film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The Ohio House of Representatives, 78th District, is located in Pickaway County, Ohio, Hocking County, Ohio, Morgan County, Ohio, Fairfield County, Ohio and small parts of Athens and Muskingum counties, with the major population centers being Circleville, Ohio and Logan, Ohio, as well as several villages. District 78 is primary a rural district, but falls within the Columbus Metro area. The district's boundaries were last redrawn in 2012 and the seat has been held by Republican Ron Hood since its redistricting.", 'title': 'Ohio House of Representatives, 78th District'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ron Ehrenreich (born 1950) is an American credit union officer and teacher. He was the Vice-Presidential candidate for the Socialist Party USA in the United States presidential election, 1988, as the running mate of Willa Kenoyer. The ticket received 3,882 votes, 2,587 of the votes came from New Jersey. He has been the treasurer of the Syracuse Cooperative Federal Credit Union since its opening in 1982. He later ran as a Green Party candidate for Onondaga County, New York Comptroller in 1999. Ron is married to Sondra Roth, and has two children, Hanah and Sam.', 'title': 'Ron Ehrenreich'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Rochester Hills is a city in northeast Oakland County of the U.S. state of Michigan, in the northern outskirts of Metropolitan Detroit area. As of the 2010 census, the city had a total population of 70,995.', 'title': 'Rochester Hills, Michigan'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Jasper County Community Unit School District 1 is a unified school district based in Jasper County's county seat of Newton, Illinois; it is the only school district in the county and is, consequently, the main educational body in all of Jasper County, although it serves portions of Effingham County and Cumberland County as well. This school district is composed of six schools in total; four elementary schools, one junior high school, and one high school. There is also a prekindergarten program run at the high school of the district should parents wish to enroll their children early. Willow Hill Elementary School, which is located in the village of its namesake, serves only kindergarteners; its proximity to the county seat and central position in the county allows its students to dawn from all parts of the county and still have easy access to the elementary school they will attend. The principal of Willow Hill is Dave Parker. Grove Elementary School is located in Island Grove, Illinois, the highest point of elevation in the county. Grove Elementary School educates students from kindergarten to grade six, and it runs a prekindergarten program as well. Craig Carr is the principal of this school. Ste. Marie Elementary School is located in the southern Jasper County village of Ste. Marie, and serves students in grades one through six. The principal of Ste. Marie is David Parker, the principal of Willow Hill Elementary School. Newton Elementary School is located in the county seat of Newton, and serves most of west Jasper County's first through sixth graders under principal Travis Wyatt. The latter three elementary schools feed into Jasper County Junior High School and are taught in the facility during seventh and eighth grade while being supervised by Newton Elementary School principal Travis Wyatt before graduating into Newton Community High School. Students in grades nine through twelve spend their last leg of precollegiate education at this school; their principal is Ruth Kerner. The district superintendent is Ron Alburtus, and the district's mascot is the eagle.", 'title': 'Jasper County Community Unit School District 1'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Northern Ireland Association of Aeromodellers (NIAA), is the governing body for all British Model Flying Association (BMFA) affiliated clubs in Northern Ireland. The NIAA committee is elected by, and from representatives of the local Northern Ireland flying clubs, with an aim to promote, protect, organise and encourage model aircraft flying throughout Northern Ireland. Additionally the organisation coordinates local club events and activities, and acts as a contact and representative on their behalf to the BMFA. The NIAA is accredited in these rolls by the Sports Council for Northern Ireland (SCNI), and the BMFA who are delegated by the Royal Aero Club to be responsible for all aspects of model flying in Great Britain. The BMFA is also recognised as the sole representative organisation for the sport in the UK by the Fédération Aéronautique Internationale (FAI) which is the world wide governing body for all forms of sporting aviation, including model flying.', 'title': 'Northern Ireland Association of Aeromodellers'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Jacqueline Anne "Jackie" Woodburne (born 5 February 1956) is a Northern Ireland born Australian actress best known for her television roles in soap operas "Prisoner" and "Neighbours".', 'title': 'Jackie Woodburne'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Martin "Marty" McCann (born 20 July 1983) is an actor from Northern Ireland.', 'title': 'Martin McCann (actor)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '"There\'s a Whole Lot of Loving" is a 1975 hit song by Guys \'n\' Dolls written by Christian Arnold with lyrics by David Martin and Geoff Morrow. The song was a #2 hit in both the UK and Ireland, and became the biggest hit for the group. The song was covered as "Whole Lotta Lovin\'" by Six and was a number one single in Ireland in 2002.', 'title': "There's a Whole Lot of Loving"}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'James "The King" Brown (born 1968) is a Belfast-born Elvis Presley tribute act known for his covers of songs done in the style of Elvis. In the vein of "songs that Elvis should have done," Brown performs songs like "Whole Lotta Rosie", originally by AC/DC, and "Crazy Little Thing Called Love", originally by Queen.', 'title': 'James Brown (Elvis impersonator)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The United Kingdom of Great Britain and Northern Ireland competed as Great Britain at the 2016 Summer Olympics in Rio de Janeiro, Brazil, from 5 to 21 August 2016. The United Kingdom was represented by the British Olympic Association (BOA), and the team of selected athletes was also known as Team GB. British athletes have appeared in every Summer Olympic Games of the modern era, alongside Australia, France, Greece, and Switzerland, though Great Britain is the only country to have won at least one gold medal at all of them. Although the British Olympic Association is the National Olympic Committee (NOC) for Great Britain and Northern Ireland, Northern Irish athletes can choose whether to compete for Great Britain or for the Republic of Ireland, as they are entitled to citizenship of either nation under the Good Friday Agreement. In 2016 Northern Ireland born representatives in Team GB included returning rowers Alan Campbell, Peter Chambers and Richard Chambers, archer Patrick Huston and four members of the men's field hockey team: David Ames, Mark Gleghorne, Iain Lewers and Ian Sloan. The team also represents, and included representation from, the Crown dependencies, among which were Guernsey's Heather Watson and Carl Hester, and from the ten of the thirteen British Overseas Territories represented by the BOA rather than their own NOC, whose representatives include Turks and Caicos-born sprinter Delano Williams and Anguillan-born long jumper Shara Proctor", 'title': 'Great Britain at the 2016 Summer Olympics'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'John Cameron (born 20 March 1944, Woodford, Essex, England) is a British composer, arranger, conductor and musician. He is well known for his many film, TV and stage credits, and for his contributions to "pop" recordings, notably those by Donovan, Cilla Black and the group Hot Chocolate. Cameron\'s instrumental version of Led Zeppelin\'s "Whole Lotta Love", became a hit for his group Collective Consciousness Society and, for many years, a version of Cameron\'s arrangement was used as the theme music for the BBC TV show, "Top of the Pops".', 'title': 'John Cameron (musician)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Whole Lotta Trouble" is a song by the American singer-songwriter Stevie Nicks. The song was written by Nicks and Tom Petty and the Heartbreakers guitarist Mike Campbell. The song became a minor hit in the United Kingdom, reached #62 on the charts. In Ireland, The song gained much more attention, reached #22 on the charts. The song was last performed by Nicks on August 29, 2000 where it was performed in San Diego, California. The song was nominated for the Grammy Award for Best Rock Vocal Performance, Female.', 'title': 'Whole Lotta Trouble'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Beauty and the Beast" is a song by the American singer-songwriter Stevie Nicks. It is the final track on her second album "The Wild Heart", released in 1983. It was later released in a live version from Nicks 1986 "Rock a Little" tour as a B-side to the UK single "Whole Lotta Trouble" in October 1989. It also appears on two compilations: "Timespace – The Best of Stevie Nicks", released in 1991, and the boxset, "Enchanted", released in 1998. A new studio version appears on her album, "The Soundstage Sessions", released in 2009.', 'title': 'Beauty and the Beast (Stevie Nicks song)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "Whole Lotta Sole (known as Stand Off in North America) is a 2012 independent comedy film written and directed by Terry George and starring Brendan Fraser, David O'Hara, Colm Meaney, Yaya DaCosta and Martin McCann.", 'title': 'Whole Lotta Sole'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'In mathematics, a near polygon is an incidence geometry introduced by Ernest E. Shult and Arthur Yanushka in 1980. Shult and Yanushka showed the connection between the so-called tetrahedrally closed line-systems in Euclidean spaces and a class of point-line geometries which they called near polygons. These structures generalise the notion of generalized polygon as every generalized 2"n"-gon is a near 2"n"-gon of a particular kind. Near polygons were extensively studied and connection between them and dual polar spaces was shown in 1980s and early 1990s. Some sporadic simple groups, for example the Hall-Janko group and the Mathieu groups, act as automorphism groups of near polygons.', 'title': 'Near polygon'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Bimal N. Patel is a Professor of Public International Law and the current Director of the Gujarat National Law University, Gandhinagar. He was appointed by a High Level Committee headed by the then Chief Justice of India, K G Balakrishnan, at the Supreme Court of India premises. The Government of India has also recently appointed him as a member of the 21st Law Commission of India along with Justice Balbir Singh Chauhan, retired Judge of the Hon'ble Supreme Court of India as its chairperson. Prof. Patel is a former International civil servant, scholar and academician of international law and diplomacy.An acclaimed international law jurist, he has extensively studied, researched, commented and published works on the administrative, procedural and substantive jurisprudence of the International Court of Justice (ICJ), International Tribunal for the Law of the Sea (ITLOS), International Criminal Tribunal for former Yugoslavia (ICTY) and International Labour Organisation Administrative Tribunal (Geneva). His publications on India and International Law and Responsibility of International Organisations are reviewed and referred by international law scholars and journals across the world. He has published, edited several books, research papers/articles/surveys in leading academic and international law journals. He has been involved in drafting several national and state primary and secondary legislations, regulations, rules and holds the distinction as one of the first Indians to serve at the International Labour Organization Administrative Tribunal (Geneva). He has delivered numerous lectures, including one at Cambridge University, UK, and has received several honours. He has served at the Organisation for the Prohibition of Chemical Weapons,Hague, Netherlands.", 'title': 'Bimal N. Patel'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'William N. Fenton (December 15, 1908 – June 17, 2005) was an American scholar and writer known for his extensive studies of Iroquois history and culture. He started his studies of the Iroquois in the 1930s and published a number of significant works over the following decades. His final work was published in 2002. During his career, Fenton was director of the New York State Museum and a professor of anthropology at the State University of New York.', 'title': 'William N. Fenton'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Nematostella is a genus of sea anemones in the family Edwardsiidae. There are three species. The best known is the starlet sea anemone ("N. vectensis"), which has been extensively studied as a model organism in fields such as genetics, evolution, and ecology. The defining morphological apomorphy of "Nematostella" is the presence of nematosomes.', 'title': 'Nematostella'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "William N. Rhodes was an American airforce Technical Sergeant in World War II. On March 31, 1945, TSgt. William N. Rhodes' aircraft was engaged in a mission to take out a primary target (oil refinery) at Ziet, Germany. During that engagement his B-17 aircraft was hit by enemy fire. The number three engine oil supply line was cut by flak, and the landing gear was hit and jammed. Flak also damaged an engine housing causing that prop to be shut down and feathered. The Aircraft was able to maintain an altitude of 17,500 feet and began its journey back to England when two jet propelled German fighters attacked. These two German aircraft were sighted and immediately reported to the pilot by TSgt. Rhodes. The B-17 was hit during the German fighter attack inflicting extensive damage to the aircraft's number three fuel tank, causing it to explode and tossed the right wing violently. Following this hit the aircraft went into a tight downward spin, within just a few thousand feet the tail section of the aircraft blew off causing the aircraft to level off slightly and continue falling in a shallow spin. This presented the opportunity for the Navigator, Turret Gunner, Co-Pilot and TSgt. Rhodes to bail out. TSgt. Rhodes and three other crew members landed near Biberach, Germany. Of the nine original crew members on the B-17, only four survived the aerial encounter. Upon landing, TSgt. Rhodes and the other survivor’s were captured by German troops waiting on the ground, searched and taken to a Luftwaffe camp where they were processed as Prisoners of war.", 'title': 'William N. Rhodes'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The Ashanti (also spelled Asante) Empire (1701–1957) was an Akan empire and kingdom in what is now modern-day Ghana. The Ashanti Empire expanded from Ashanti to include the Brong-Ahafo, Central region, Eastern region, Greater Accra region, and Western region, of present-day Ghana. The Ashanti benefited from early firearm adoption. Combined with effective strategy, they fashioned an empire that stretched from central Ghana to the present-day Ivory Coast. Due to the empire's military prowess, wealth, architecture, sophisticated hierarchy and culture, Ashanti has been extensively studied and has more historiographies by European, primarily British, authors than almost any other indigenous culture of Sub-Saharan Africa.", 'title': 'Ashanti Empire'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The Iroquois ( or ) or Haudenosaunee ( ) are a historically powerful northeast Native American confederacy. They were known during the colonial years to the French as the "Iroquois League," and later as the "Iroquois Confederacy," and to the English as the "Five Nations" (before 1722), and later as the "Six Nations," comprising the Mohawk, Onondaga, Oneida, Cayuga, Seneca, and Tuscarora peoples.', 'title': 'Iroquois'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Kunda Culture, originating from the Swiderian culture, comprised mesolithic hunter-gatherer communities of the Baltic forest zone extending eastwards through Latvia into northern Russia, dating to the period 8500–5000 BC according calibrated radiocarbon dating. It is named after the Estonian town of Kunda, about 110 km east of Tallinn along the Gulf of Finland, near where the first extensively studied settlement was discovered on Lammasmäe Hill and in the surrounding peat bog. The oldest known Kunda culture settlement in Estonia is Pulli. The Kunda Culture was succeeded by the Narva culture, who used pottery and showed some traces of food production.', 'title': 'Kunda culture'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Oliver Phase is the name for a Late Woodland Native American culture that flourished from 1200 and 1450 CE along the east and west forks of the White River in central and southern Indiana. The Oliver Phase is of the Western Basin Tradition which includes the Springwells Phase, the Younge Phase, and the Riviere au Vase Phase. Oliver people were village dwelling farmers with a heavy reliance on maize, very similar to other Late Woodland peoples in the area the Oneota, Fort Ancient, and Monongahela cultures. The name was originally coined by archaeologist James B. Griffin in 1946 to describe a Late Woodland ceramic complex centered in Hamilton and Marion counties in the valley of the West Fork of the White River first extensively studied at the Bowen site.', 'title': 'Oliver Phase'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Candicine is a naturally occurring organic compound that is a quaternary ammonium salt with a phenethylamine skeleton. It is the N,N,N-trimethyl derivative of the well-known biogenic amine tyramine, and, being a natural product with a positively charged nitrogen atom in its molecular structure, it is classed as an alkaloid. Although it is found in a variety of plants, including barley, its properties have not been extensively studied with modern techniques. Candicine is toxic after parenteral administration, producing symptoms of neuromuscular blockade; further details are given in the "Pharmacology" section below.', 'title': 'Candicine'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Overdrive is a 2017 action thriller film directed by Antonio Negret, produced by Michael Brandt, Derek Haas and Pierre Morel and the screenplay was written by Michael Brandt and Derek Haas. The film stars Scott Eastwood, Freddie Thorp, Ana de Armas, and Gaia Weiss. Principal photography began on January 4, 2016 in Paris and Marseille, France. The film tells the story of Andrew and Garret Foster, young brothers who are skilled car thieves which having expertise in the most luxury cars, they both are sent to steal a Bugatti car at Southern France, but they are getting caught by the car's owner; a ruthless local crime lord. In exchange for their life and for apology for attempting to steal his car, the crime lord forces the brothers into stealing a luxury Ferari car from the crime lord's arch-rival.", 'title': 'Overdrive (2017 film)'}
