 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'From Paris with Love is a 2010 English-language French action film starring John Travolta and Jonathan Rhys Meyers and directed by Pierre Morel. The screenplay was co-written by Luc Besson. The film was released in the United States on February 5, 2010.', 'title': 'From Paris with Love (film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Taken is a 2008 English-language French action thriller film directed by Pierre Morel, written by Luc Besson and Robert Mark Kamen, and starring Liam Neeson, Maggie Grace, Leland Orser, Jon Gries, David Warshofsky, Holly Valance, Katie Cassidy, Xander Berkeley, Olivier Rabourdin, Gérard Watkins, and Famke Janssen.', 'title': 'Taken (film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Pierre Morel (born 10 September 1930) is a French former professional racing cyclist. He rode in the 1960 Tour de France.', 'title': 'Pierre Morel (cyclist)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'District 13 (French title "Banlieue 13" or "B13"), is a 2004 French action film directed by Pierre Morel and written and produced by Luc Besson. The film is notable for its depiction of parkour in a number of stunt sequences that were completed without the use of wires or computer generated effects. Because of this, some film critics have drawn comparisons to the popular Thai film "". David Belle, regarded as the founder of parkour, plays Leïto, one of the protagonists in the film.', 'title': 'District 13'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Gunman is a 2015 action thriller film directed by Pierre Morel and written by Don Macpherson, Pete Travis and Sean Penn, based on the novel "The Prone Gunman" (French title: "La position du tireur couché") by Jean-Patrick Manchette. It stars Penn, with Idris Elba, Ray Winstone, Mark Rylance, and Javier Bardem appearing in supporting roles. The film is about Jim Terrier (Penn), a mercenary who assassinates the Minister of Mining of the Democratic Republic of Congo in 2006 on orders from multinational mining companies. Eight years after Terrier has retired from mercenary work, he and the people close to him become the targets of hit squads sent by a powerful multinational security firm, and he must fight to stay alive. The film was released on March 20, 2015 by Open Road Films. It was a box office bomb, grossing just $24 million against its $40 million budget and seeing a poor critical reception.', 'title': 'The Gunman (film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Pierre Morel d\'Arleux (8 April 1897 – 29 March 1964) was a French philatelist who signed the Roll of Distinguished Philatelists in 1950. He was Honorary Secretary of the "Académie de Philatelie" and Honorary Secretary of the "Société des Amis du Musée Postal".', 'title': "Pierre Morel d'Arleux"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Edmund Dene Morel, originally Georges Eduard Pierre Achille Morel de Ville (10 July 1873 – 12 November 1924), was a British journalist, author, pacifist, and politician. In collaboration with Roger Casement, Morel led a campaign against slavery in the Congo Free State, founding the Congo Reform Association and running the "West African Mail". He played a significant role in the British pacifist movement during the First World War, participating in the foundation and becoming secretary of the Union of Democratic Control, at which point he broke with the Liberal Party. After the war he joined the Independent Labour Party. Bertrand Russell said of Morel, "No other man known to me has had the same heroic simplicity in pursuing and proclaiming political truth."', 'title': 'E. D. Morel'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Pierre Morel (born 12 May 1964) is a French film director and cinematographer. His work include "District 13", "From Paris with Love" and "Taken."', 'title': 'Pierre Morel'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Bill Bonner is an American author of books and articles on economic and financial subjects. He is the founder and president of Agora, Inc., as well as a co-founder of Bonner & Partners publishing. Bonner has written articles for the news and opinion blog LewRockwell.com, "MoneyWeek" magazine, and his daily financial column "Bill Bonner\'s Diary".', 'title': 'Bill Bonner (author)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'BBC Focus is a British monthly magazine about science and technology published in Bristol, UK by Immediate Media Company. Under the editorship of Daniel Bennett it covers all aspects of science and technology and is written for general readers as well as people with a knowledge of science. Formerly known as Focus, the magazine was taken over by BBC Magazines in mid-2005 and renamed in "BBC Focus". There are also regular science celebrity features and interviews.', 'title': 'BBC Focus'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Armando Zamora (born 1958, in Hermosillo, Sonora, Mexico) is a journalist, writer and musician. Zamora has written articles, poems, short stories and novels. A number of these deal with topics related to agriculture, many of which are academic in nature. His work has won a number of awards including first place in the Juegos Florales Anita Pompa de Trujillo in 1981, first in the Juegos Feria Amealco 92 in Querétero, the Concurso de Cuento in 1986, and an honorable mention at the World of Poetry in Miami, Florida. His major works include "Cuadriludios", "Mi corazón es un gato enfermo y al borde del tejado", "Equinoccios de la soledad", "Bitácora del náufrago y otros poemas" and "Navegación al interior". His best-known novel is "El que se raje es puto". He has also written a large number of magazine articles.', 'title': 'Armando Zamora'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Rex Gilroy (born November 9, 1943) is an Australian who has written articles and self-published books on cryptids and unexplained or speculative phenomena. His work has focused on yowie reports, 'out of place' animals, UFOs, and propositions regarding a 'lost' Australian civilization. He has contributed to, or been the subject of, several articles, in speculative media such as Nexus magazine and in Australian newspapers. He is the author and publisher of several books, the first of which appeared in 1986. He has documented over 3000 reports relating to yowies. His eclectic career has seen field research into butterflies and anthropology, but he remains most notable for his controversial searches for the recently extinct thylacine, moas, alien big cats or the source of the yowie legend.", 'title': 'Rex Gilroy'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Daniel Smith (born October 7, 1977) is an American journalist and author of the 2012 memoir "Monkey Mind: A Memoir of Anxiety". He has written articles and essays for "The New York Times Magazine", "The Atlantic", "Slate", "n+1", "Harper\'s Magazine", "New York", and others.', 'title': 'Daniel Smith (writer)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'A magazine is a publication, usually a periodical publication, which is printed or electronically published (sometimes referred to as an online magazine). Magazines are generally published on a regular schedule and contain a variety of content. They are generally financed by advertising, by a purchase price, by prepaid subscriptions, or a combination of the three. At its root, the word "magazine" refers to a collection or storage location. In the case of written publication, it is a collection of written articles. This explains why magazine publications share the word root with gunpowder magazines, artillery magazines, firearms magazines, and, in French, retail stores such as department stores.', 'title': 'Magazine'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Piers Bizony is a science journalist, space historian, author, and exhibition organiser. Bizony specialises in the topics of outer space, special effects, and technology. He has written articles for "The Independent", "BBC Focus" and "Wired". His 1997 book "The Rivers of Mars" was shortlisted for the Eugene M. Emme Astronautical Literature Award. His book "2001: Filming the Future" (1994, revised 2000, expanded 2014) is an authoritative reference about Stanley Kubrick\'s film "".', 'title': 'Piers Bizony'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Born in Oldenburg, Germany, Breiholz studied literature, theatre, musicology and art history at Free University of Berlin. In 1988 he did an internship at "Opera News" in New York City which led to an assignment as a freelance writer for the magazine. Until 2004, he worked for Opera News as a music critic, reporting mainly on the European opera scene. In 1996, Breiholz became a frequent contributor for "Opernwelt" magazine in Berlin. From 1997 until 2002 he worked as a writer and editor of the Arts section for the German daily newspaper "Die Welt". In 2002 he moved back to New York and worked as a correspondent for several European publications, reporting on opera, classical music concerts, and theatre. He has written articles for the British magazine "Opera Now", the German magazine "Rondo", "The Wall Street Journal Europe" and the Swiss magazine "Musik & Theater", among other publications. He has also worked as an interviewer for classical music radio programs. In 2005 he worked as a talent scout for a New York artists agency. He was Director of International Relations for the Latvian National Opera in Riga, Latvia, from 2006 until 2011 and also worked as dramaturg for the company. From August 2011 until March 2016 he was the Artistic Director of the Vlaamse Opera in Antwerp, Belgium. Since April 2016 he is the Director of Artistic Administration and Casting at Theater an der Wien in Vienna.', 'title': 'Jochen Breiholz'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Mohammad Abdi (Persian:محمد عبدی, Tehran, Iran, 1974) is a writer, film critic, and art researcher. He has written articles for more than 40 publications and journals in Persian in Iran and abroad. From 1999 - 2000, Abdi served as editor-in-chief of "Seventh Art" magazine, a theoretic magazine on film and cinema. In 1998, Abdi published "Film Criticism in Iran", an analytical, historical study on film criticism in Iran. He and some other film critics were arrested in 2003 by the government of Islamic republic of Iran in reprisal for his articles.', 'title': 'Mohammad Abdi'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Bruce Barcott is an American editor, environmental journalist and author. He is a contributing editor of "Outside" and has written articles for "The New York Times Magazine", "National Geographic", "Mother Jones", "Sports Illustrated", "Harper\'s Magazine", "Legal Affairs", "Utne Reader" and others. He has also written a number of books, including "The Measure of a Mountain: Beauty and Terror on Mount Rainier" (1997) and "The Last Flight of the Scarlet Macaw: One Woman\'s Fight to Save the World\'s Most Beautiful Bird" (2008). In 2009 he was named a Guggenheim Fellow in nonfiction.', 'title': 'Bruce Barcott'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Marc André Laguerre (February 21, 1915 – January 18, 1979) was a journalist and magazine editor, best known as the managing editor of "Sports Illustrated" from 1960 to 1974, during which time he oversaw the growth in the magazine from a niche publication to become the industry leader in weekly sports magazines. It was under his leadership that the annual "Sports Illustrated Swimsuit Issue" was first published. When he retired in 1974, he had been managing editor of the magazine for 704 issues, then a record among magazines published by Time, Inc., SI\'s parent company.', 'title': 'André Laguerre'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'World Soccer is an English language football magazine published by IPC Media. The magazine was established in 1960. It specialises in the international football scene. Its regular contributing writers include Brian Glanville, Sid Lowe and Tim Vickery. "World Soccer" is a member of the European Sports Magazines (ESM), an umbrella group of similar magazines printed in other languages. Other members include "A Bola", "Don Balón", "Kicker", "La Gazzetta dello Sport" and "Sport Express". The members of this group elect a European "Team of the Month" and a European "Team of the Year".', 'title': 'World Soccer (magazine)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Ejikeme Ikwunze, popularly called Mr Football, is an international figure in Nigeria\'s sporting community. He is a sports columnist and contributes articles to several international sports magazines as well as Nigerian Newspapers including the "National Ambassador", "Vanguard", "ThisDay" and the "Daily Champion". He also features as a sports commentator on several stations such as "Federal Radio Corporation of Nigeria", the "BCA Radio", "Abia Television" and "Pacesetter Radio".', 'title': 'Ejikeme Ikwunze'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'El Gráfico is a classic monthly Argentine sports magazine. The magazine was originally published as a weekly newspaper in May 1919, and then turned to a sports magazine exclusively. It has been scheduled monthly from 2002. "El Gráfico" is one of the most regarded sports magazines not only in Argentina but in Latin America. The magazine was nicknamed "La Biblia del deporte" ("The Bible of sports") due to its chronicles, notable journalists and collaborators and its photography.', 'title': 'El Gráfico'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Ranger Rick, originally Ranger Rick\'s Nature Magazine, is a children’s nature magazine that is published by the United States National Wildlife Federation. The magazine offers feature articles and activities for children, ages 7 and up, in order to spark their interest in the outdoors and become more actively involved in the environment. The magazine\'s primary intention is to instill a passion for nature and promote activity outdoors. NWF also publishes two companion magazines, "Ranger Rick Jr.", which is aimed at ages 4–7, and "Ranger Rick Cub", which is aimed at kids 0–4 years old.)', 'title': 'Ranger Rick'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'TENNIS is an American sports magazine owned by the Sinclair Broadcast Group. There are eight issues per year covering the world of tennis. The "tennis.com" website is an offshoot of the magazine and part of the same media company.', 'title': 'Tennis (magazine)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Lorin Thompson, Lorin Hartwell Jr Thompson, (1911–1997), was a muralist, artist, and creator and illustrator of the character "Ranger Rick" for the National Wildlife Federation\'s children\'s magazine, Ranger Rick.', 'title': 'Lorin Thompson'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Albert Houston Carter Jr. (born May 20, 1952) is a former reporter and sports columnist for the "Houston Chronicle", "The Dallas Morning News" and other major daily newspapers in Texas and Oklahoma. His writing career spanned three decades. He was the recipient of numerous national and regional writing awards, including Oklahoma Sportswriter of the Year (1980) and Texas Sportswriter of the Year (1985). He has made frequent appearances on TV and radio sports shows and has had numerous articles published in sports magazines and books.', 'title': 'Al Carter'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Charles Richards Gordon, known as Dick "Scoop" Gordon (January 15, 1911\xa0– December 8, 2008), was an American sports journalist whose works were a regular feature in venerable sports magazines like "The Sporting News", "Sports Illustrated", and "Baseball Digest". After earning his nickname "Scoop" in 1930 by reporting for "The Daily Princetonian" that golfing legend Bobby Jones would be retiring from active competition, Gordon went on to a sports reporting career which ended in 2008.', 'title': 'Dick Gordon (sports writer)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Football World, later renamed "Athletic World", was an American magazine devoted to the coverage of inter-collegiate sports. Its masthead described it as "A Magazine With a Mission to Serve the College Man," a publication "devoted to Inter-collegiate Athletics and sports of Amateur standing only." It was founded in 1921 by J. D. Fetzer. The name of the magazine was later changed to "Athletic World" as the coverage extended to a broader range of sports, including women\'s swimming. Unlike other sports magazines of the era, which focused on promoting a healthy lifestyle, "Football World/Athletic World" celebrated the entertainment value of sports with a special emphasis on the personalities of famous athletes. The magazine was renamed "Outing" in December 1924, reflecting a change in its focus.', 'title': 'Football World'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Officer is a satellite suburb of Melbourne, Victoria, Australia, 54\xa0km south-east of Melbourne's Central Business District, located within the Shire of Cardinia local government area. Officer recorded a population of 7,133 at the 2016 Census.", 'title': 'Officer, Victoria'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Broken Hill was an electoral district of the Legislative Assembly in the Australian state of New South Wales. From 1894 to 1913, the Broken Hill district was covered by the electoral districts of "Broken Hill", Willyama and Sturt. In the 1912 redistribution, the electoral district of "Broken Hill" was abolished and absorbed into "Willyama" and "Sturt". In 1920, "Willyama", "Sturt" and the electoral district of Cobar were combined to create a three-member "Sturt". In 1927, single-member electorates were recreated and the city of Broken Hill was split between "Sturt" and Murray. From 1932, the city of Broken Hill was split between "Sturt" and Cobar. In 1968 "Sturt" was renamed Broken Hill and included all of the city of Broken Hill. In 1999, it was merged with part of "Murray" and renamed the electoral district of Murray-Darling.', 'title': 'Electoral district of Broken Hill'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Braidwood was an electoral district of the Legislative Assembly in the Australian state of New South Wales between 1859 and 1904, which included the town of Braidwood. It replaced parts of the electoral district of United Counties of Murray and St Vincent and the electoral district of Southern Boroughs. In 1904 it was largely absorbed into the electoral district of Queanbeyan.', 'title': 'Electoral district of Braidwood'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The electoral district of Nunawading was an electoral district of the Legislative Assembly in the Australian state of Victoria, located in the eastern Melbourne suburb of Nunawading. A notable former member was future Prime Minister, Robert Menzies.', 'title': 'Electoral district of Nunawading'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The Electoral district of Bass is an electoral district of the Victorian Legislative Assembly. It covers an area of 1,383 sqkm south east of Melbourne, stretching from outer suburban Pakenham through rural areas to the coast at Inverloch and Phillip Island. It includes the towns of Bass, Cape Patterson, Corinella, Cowes, Grantville, Inverloch, Kilcunda, Koo Wee Rup, Lang Lang, Rhyll, San Remo, Ventnor, Wonthaggi, and part of suburban Pakenham. It lies within the Eastern Victoria Region of the upper house, the Legislative Council.', 'title': 'Electoral district of Bass'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Emerald Hill was an electoral district of the Victorian Legislative Assembly, Australia. It covered part of the inner-city suburb South Melbourne and consisted part of the previous Electoral district of South Melbourne which was abolished in 1859. (The other part of the South Melbourne electorate became the Electoral district of Sandridge).', 'title': 'Electoral district of Emerald Hill'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Pakenham is a satellite suburb of Melbourne on the edge of the West Gippsland region of Victoria, Australia, 56 km south-east of Melbourne's Central Business District, located within the Shire of Cardinia local government area. Pakenham recorded a population of 46,421 at the 2016 Census.", 'title': 'Pakenham, Victoria'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'North Eastern Boroughs was an electoral district of the Legislative Assembly in the Australian state of New South Wales from 1856 to 1859 that included the towns of Newcastle, Stockton and Raymond Terrace. It was partly replaced by the electoral district of Newcastle and the electoral district of Hunter.', 'title': 'Electoral district of North Eastern Boroughs'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Beaconsfield is a satellite suburb of Melbourne, Victoria, Australia, 46\xa0km south-east of Melbourne's Central Business District, located within the Shire of Cardinia local government area. Beaconsfield recorded a population of 6,714 at the 2016 Census.", 'title': 'Beaconsfield, Victoria'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Electoral district of Tullamarine was an electoral district of the Legislative Assembly in the Australian state of Victoria. The district centred on the suburb of Tullamarine, about 17km north-west of Melbourne.', 'title': 'Electoral district of Tullamarine'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Rockaway Beach" is a song by the American punk rock band the Ramones from their 1977 album "Rocket to Russia". The song was written by bassist Dee Dee Ramone in the style of the Beach Boys and early surf rock bands. The song is about Rockaway Beach, Queens, where Dee Dee liked to spend time. Guitarist Johnny Ramone claimed that Dee Dee was "the only real beachgoer" in the group. Released in 1977, it was the Ramones\' highest-charting single in their career, peaking at number 66 on the "Billboard" Hot 100. In June, 2013, the song was used in a radio ad campaign sponsored by Queens Economic Development Corporation to promote recovery from Hurricane Sandy by drawing New Yorkers back to Rockaway Beach.', 'title': 'Rockaway Beach (song)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Dee Dee Ramone I.C.L.C. (Inter-Celestial Light Commune) was a solo project by Ramones bassist Dee Dee Ramone.', 'title': 'Dee Dee Ramone I.C.L.C.'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Dum Dum Girls are an American rock band, formed in 2008. It began as the bedroom recording project of singer and songwriter Dee Dee (née Kristin Gundred). She is currently based in New York City. The name is a double homage to the Vaselines\' album "Dum Dum" and the Iggy Pop song "Dum Dum Boys". Critics initially assumed that Dee Dee\'s stage name was inspired by Dee Dee Ramone, but she stated that this was not true; it was her mother\'s name, which she took as her middle name after her mother\'s death. The last name "Penny" was erroneously provided by British music magazine "NME".', 'title': 'Dum Dum Girls'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Ramainz were a U.S. tribute band to the Ramones. Its members included Dee Dee Ramone, Marky Ramone, Dee Dee\'s wife Barbara Zampini (also known as Barbara Ramone) and C. J. Ramone. They were known as The Remains until 1999 but had to change the spelling due to another band already using the name. They released one live album entitled "Live in N.Y.C." on 8 October 2002, four months after Dee Dee Ramone\'s death on 5 June.', 'title': 'The Ramainz'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Douglas Glenn Colvin (September 18, 1951\xa0– June 5, 2002), known professionally as Dee Dee Ramone, was a German-American musician, singer and songwriter best known as founding member, songwriter, bassist and occasional lead vocalist for the punk rock band the Ramones.', 'title': 'Dee Dee Ramone'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Youth Gone Mad featuring Dee Dee Ramone is a collaboration studio album by the American punk band the Youth Gone Mad and former Ramones bassist Dee Dee Ramone. It was released on December 31, 2002 (see 2002 in music). This is known to contain Dee Dee\'s final studio recordings before his death in June 2002. Originally issued as a 12" picture disc LP by tREND iS dEAD! records, the vinyl featured paintings by Dee Dee and Youth Gone Mad frontman Paul Kostabi on both sides and the insert. The album was remastered and released on compact disc by the same record label in 2003. A standard vinyl LP edition with different artwork was released in Germany by Wanker Records, also in 2003.', 'title': 'Youth Gone Mad Featuring Dee Dee Ramone'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Chelsea Horror Hotel: A Novel is a 2001 novel by Dee Dee Ramone, a member of the punk band The Ramones. It was released 13 months before Dee Dee died due to a heroin overdose. The book follows Dee Dee as he dictates daily events at the Hotel Chelsea in New York City with his wife Barbra and dog Banfield. Dee Dee is convinced that the room he stays in is the same where his old friend Sid Vicious killed his girlfriend, Nancy Spungen. Dee Dee is further visited by other dead punks, including Johnny Thunders and Stiv Bators.', 'title': 'Chelsea Horror Hotel'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Animal Boy is the ninth studio album released by the American punk band the Ramones through Sire Records on May 19, 1986. Due to conflicts within the group, the album features less of lead singer Joey Ramone, both in performing and writing, and less of lead guitarist Johnny Ramone. Bassist Dee Dee Ramone wrote and sang more on this album than previous albums, and Richie Ramone became the first drummer to write songs for the band. The album spawned four singles, all of which charted on the UK Singles Chart. In addition to singles, the band promoted their album by making a music video which parodied the benefit concerts Live Aid and Hands Across America.', 'title': 'Animal Boy'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Dee Dee Ramone and the Chinese Dragons was a band fronted by former Ramones bassist Dee Dee Ramone. It was formed in March 1992, and was the second post-Ramones band for Dee Dee, following Dee Dee Ramone and the Spikey Tops. The band was made up of Ramone on guitar and vocals, former Liars, Cheats and Thieves members Richie Screech (aka Richie Karaczynski) and Alan Valentine on guitar and bass respectively, and Scott Goldstein on drums. In the band\'s short time together, they only released one 7" single which featured an original song on the a-side and a cover of the New York Dolls\' "Chatterbox" on the b-side. Ramone\'s next project after this was Dee Dee Ramone I.C.L.C.', 'title': 'Dee Dee Ramone and the Chinese Dragons'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Ben Weasel (born Benjamin Foster) is a punk rock musician, best known as the lead singer and guitarist of the band Screeching Weasel. He is also the co-host of "Weasel Radio", a weekly radio show formerly on ESPN 1070, which has been relaunched as a podcast.', 'title': 'Ben Weasel'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Sidehackers (also known as Five the Hard Way) is a 1969 American action film about motorcycle racing with a twist. Each motorcycle has a sidehack (or "sidecar"), in which a passenger rides and tilts to one side or another when going around curves. The credits thank the "Southern California Sidehack Association"; sidehacking is also known as sidecarcross or "sidecar motocross racing".', 'title': 'The Sidehackers'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Last Boy Scout is a 1991 American action comedy film directed by Tony Scott, starring Bruce Willis, Damon Wayans, Chelsea Field, Noble Willingham, Taylor Negron and Danielle Harris. The film was released in the United States on December 13, 1991.', 'title': 'The Last Boy Scout'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Hard Way is a 1991 American action comedy film directed by John Badham, and starring Michael J. Fox and James Woods. Stephen Lang, Annabella Sciorra, Luis Guzmán, LL Cool J, Delroy Lindo, Christina Ricci, Mos Def, Kathy Najimy, Michael Badalucco, and Lewis Black appear in supporting roles.', 'title': 'The Hard Way (1991 film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Main Khiladi Tu Anari (English: "Me, the Player, You, the Unskilled") is a 1994 Indian Hindi action comedy film directed by Sameer Malkan. The films screenplay is by Sachin Bhowmick. Starring Akshay Kumar, Saif Ali Khan and Shilpa Shetty in pivotal roles, the film went on to become one of the top 5 highest grossing movie of the year and was declared a "SUPER HIT" at the end of its theatrical run. It was the second installment in the Khiladi (film series). It was the first Bollywood action film to be reviewed by martial arts film critic Albert Valentin on the now defunct KungFuCinema.com The movie is inspired by the 1991 movie "The Hard Way".', 'title': 'Main Khiladi Tu Anari'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Hudson Hawk is a 1991 American action comedy film directed by Michael Lehmann. Bruce Willis stars in the title role and also co-wrote both the story and the theme song. Danny Aiello, Andie MacDowell, James Coburn, David Caruso, Lorraine Toussaint, Frank Stallone, Sandra Bernhard, and Richard E. Grant are also featured.', 'title': 'Hudson Hawk'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Marcus Vialva, better known by his stage name Shabaam Sahdeeq, is an alternative hip hop artist from Brooklyn, New York. He first reached fame with Rawkus Records and was featured alongside artists including Busta Rhymes, Redman, Method Man, Kool G Rap, Common, Mos Def and Eminem. Shabaam Sahdeeq is notable for his work on the "Soundbombing" and "Lyricist Lounge" series in the late 1990s and the early 2000s. In 1998, Sahdeeq collaborated with DJ Spinna, Mr. Complex and Apani B to form the hip-hop collective Polyrhythm Addicts, a supergroup renowned for its pivotal role in the explosion of late 90\'s indie hip-hop. The single "Not Your Ordinary: gained a positive critical and commercial reception, which paved the way for their first album, "Rhyme Related", released in 1999, and widely regarded as a hip-hop classic. After this success, the group disbanded to focus on their individual careers. Sahdeeq\'s distinct voice and unique delivery catapulted him to mainstream stardom on the "Simon Says" Remix alongside label mate Pharoahe Monch. He is currently releasing music independently. Shabaam Sahdeeq\'s recent work has been receiving rave reviews in some of the biggest hip-hop publications.', 'title': 'Shabaam Sahdeeq'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Three the Hard Way is a 1974 action blaxploitation film starring Fred Williamson, Jim Brown, and Jim Kelly, written by Eric Bercovici and Jerrold L. Ludwig and directed by Gordon Parks, Jr. The film features the three biggest black action stars of the 1970s in their first movie together. According to The New York Times, the theatrical version ran 93 minutes. A PG version distributed to television (and released on Xenon VHS tape) runs 105 minutes. The Warner DVD ("4 Film Favorites: Urban Action") runs 89 minutes and is missing a song (cut from the theatrical version) and some footage of boats, cars, etc.(cut from the TV version) but includes the language and nudity. The theatrical version contains scenes of three topless women, but these scenes were re-shot with them clothed for the TV version.', 'title': 'Three the Hard Way (film)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'I Learned the Hard Way is the fourth studio album by American soul and funk band Sharon Jones & The Dap-Kings, released April 6, 2010 on Daptone Records. Production for the album took place at the label\'s House of Soul Studios during 2009 to 2010 and was handled by Daptone co-founder Gabriel Roth, credited for the album as "Bosco Mann". The album debuted at number 15 on the US "Billboard" 200, selling 23,000 copies in its first week. Upon its release, "I Learned the Hard Way" received generally positive reviews from most music critics.', 'title': 'I Learned the Hard Way'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Yasiin Bey ( ) (born Dante Terrell Smith; December 11, 1973), best known by his stage name Mos Def ( ), is an American hip hop recording artist, actor and activist from Brooklyn, New York City, New York. Best known for his music, Mos Def embarked on his hip hop career in 1994, alongside his siblings in the short-lived rap group Urban Thermo Dynamics (UTD), after which he appeared on albums by Da Bush Babees and De La Soul. He subsequently formed the duo Black Star, alongside fellow Brooklyn-based rapper Talib Kweli, and they released their eponymous debut album in 1998. He was featured on the roster of Rawkus Records and in 1999 released his solo debut, "Black on Both Sides". His debut was followed by "The New Danger" (2004), "True Magic" (2006) and "The Ecstatic" (2009). The editors at About.com listed him as the 14th greatest emcee of all time on their "50 greatest MC\'s of our time" list.', 'title': 'Mos Def'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'If Looks Could Kill (released in the UK as Teen Agent) is a 1991 American action comedy spy film directed by William Dear and stars Richard Grieco.', 'title': 'If Looks Could Kill (film)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Rock \'n\' Roll Singer is the debut solo EP from Mark Kozelek. The EP was released on June 13, 2000, and was released while Kozelek\'s final album with his previous band Red House Painters (the 1998 album "Old Ramon", which didn\'t get a release until 2001) was in limbo with record label mergers. "Rock \'n\' Roll Singer" contains three original tracks and four covers: "Rock \'n\' Roll Singer," "You Ain\'t Got a Hold on Me," and "Bad Boy Boogie" originally by AC/DC, and "Around and Around" originally by John Denver.', 'title': "Rock 'n' Roll Singer"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"Feelin\' Satisfied" is a 1978 song written by Tom Scholz for the Boston band album "Don\'t Look Back". Paul Grein of "Billboard" described the song as "an affectionate tribute to the power of music." The same magazine later described the song as an "upbeat track which is totally rock \'n\' roll," praising the "clear singing" and "fresh sounds." Terry Hazlett of The "Observer-Reporter" described the song as an "innocent little [ditty]" which comes across like a "rock \'n\' roll anthem." . AXS contributor Bill Craig describes the lyrics as being about "the wonders of rock music." Pete Bishop of "The Pittsburgh Press" claimed that it has "an infectious happy feel." "Ultimate Classic Rock" critic Michael Gallucci described it as a "simple" song that, in common with many Boston songs, "celebrates rock \'n\' roll." Gallucci rated it Boston\'s 8th greatest song, particularly praising the effect from the hand claps during the refrain. Paul Elliott rated it their 7th greatest song, commenting on its "sense of fun" as Scholz lets go of some of his usual control.', 'title': "Feelin' Satisfied"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': '"Rock \'n\' Roll Star" is a song by English rock band Oasis. It is the opening track from their record breaking debut album, "Definitely Maybe". Like the majority of the band\'s songs from this era, it was written by lead guitarist Noel Gallagher. Noel said that "Rock \'n\' Roll Star" was one of only three songs in which he wanted to say something: "I\'ve pretty much summed up everything I wanted to say in "Rock \'n\' Roll Star", "Live Forever" and "Cigarettes & Alcohol", after that I\'m repeating myself, but in a different way". It became a fan favourite and was often played to close the band\'s gigs.', 'title': "Rock 'n' Roll Star"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Just... Fabulous Rock \'n\' Roll is a studio album by Cliff Richard, released 11 November 2016. The album continues the rock \'n\' roll theme of his previous studio album "The Fabulous Rock \'n\' Roll Songbook". It comprises covers of 14 classic rock \'n\' roll songs and one new song "It\'s Better to Dream". It features Elvis Presley in duet with Richard in "Blue Suede Shoes" and Peter Frampton on guitar in "Dimples". The album reached number 4 on the UK Albums Chart and has been certified Gold for sales over 100,000 in the UK.', 'title': "Just... Fabulous Rock 'n' Roll"}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Rock \'n\' Roll Lifestyle" (also known as "How Do You Afford Your Rock \'n\' Roll Lifestyle") is the debut single by Sacramento alternative rock band Cake. This song was first played by KWOD (now known as KUDL). It was later released on Cake\'s debut album, "Motorcade of Generosity". Only 500 copies were issued.', 'title': "Rock 'n' Roll Lifestyle"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'World Rock \'n\' Roll Confederation (WRRC) was registered in 1984, although its history traces to 1974. It is an umbrella organization for national professional and amateur Rock and Roll dancesport federations. Its statute that it "aims at promoting the physical training of its members by means of sporting activities in the form of Rock \'n\' Roll dance tournaments, including the acrobatic variations (acrobatic rock \'n\' roll) as well as Rock \'n\' Roll and Boogie Woogie, Lindy Hop, Formation and alternative styles in line with the rules and sporting presentations". The registered office is in Ljubljana, Slovenia.', 'title': "World Rock'n'Roll Confederation"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'It\'s Only Rock \'n Roll is the 12th British and 14th American studio album by The Rolling Stones, released in 1974. It was the last Rolling Stones album for guitarist Mick Taylor and the songwriting and recording of the album\'s title track had a connection to Taylor\'s eventual replacement, Ronnie Wood. The album also marked the 10th anniversary since the release of the band\'s debut album, "The Rolling Stones". "It\'s Only Rock \'n Roll" has a firmer rock sound than the band\'s previous album, the more funk - and soul - inspired "Goats Head Soup". "It\'s Only Rock \'n Roll" reached #1 in the US and #2 in the UK.', 'title': "It's Only Rock 'n Roll"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"I Hate Rock \'n\' Roll" is a song by the Scottish alternative rock group The Jesus and Mary Chain. It was the first single from the band\'s compilation album, "Hate Rock \'n\' Roll". It was released together with 3 other tracks by Blanco y Negro Records in June 1995 and reached #61 in the UK single charts. This release was the last release for the band on this label. The 10" format was numbered and limited to 5000 copies. The reworked version of the track, which was dubbed as "I Love Rock \'n\' Roll" was also included on the group\'s last album "Munki", released in 1998.', 'title': "I Hate Rock 'n' Roll"}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Brad Elterman is a professional photographer from Beverly Hills, California, who addressed the rock \'n\' roll lifestyle in Hollywood encompassing pop, punk and rock bands that included the Faces with Rod Stewart, David Bowie, Robert Plant, Sex Pistols, the Runaways, Bebe Buell, Kiss, Queen, Blondie, the Ramones, Bay City Rollers, ABBA, Boney M, Kenny Rogers, The Who, Leif Garrett, Michael Jackson, among others. Some of the magazines, newspapers and other publications that he contributed to include "Creem", "Circus", "Rolling Stone", "People", "Hit Parader", "New York Post", "National Enquirer", "New Musical Express", and "Melody Maker".', 'title': 'Brad Elterman'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Blondie is an American rock band founded by singer Debbie Harry and guitarist Chris Stein. The band was a pioneer in the early American new wave and punk scenes of the mid-late 1970s. Its first two albums contained strong elements of these genres, and although successful in the United Kingdom and Australia, Blondie was regarded as an underground band in the United States until the release of "Parallel Lines" in 1978. Over the next three years, the band achieved several hit singles including "Call Me", "Rapture" and "Heart of Glass" and became noted for its eclectic mix of musical styles incorporating elements of disco, pop, reggae, and early rap music.', 'title': 'Blondie (band)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'A Big Daddy is a fictional character in the "BioShock" series of video games. Big Daddies are heavily spliced (genetically mutated and altered with ADAM) human beings who have had their bodies directly grafted into heavily armored, steampunk-inspired atmospheric diving suits. They are armed with a rivet gun, heavy drill, rocket launcher, or ion laser. Alpha series Big Daddies are equipped with any of several other weapons as well. Though they make low-pitched groaning noises similar to whales, Big Daddies have no voice actor attributed to them. Designed by Irrational Games (then under the supervision of 2K Boston/2K Australia), they first appeared in "BioShock" and were promoted heavily. A six-inch Big Daddy action figure was included in the limited edition version of the title. In its sequel, "BioShock 2", the player controls a prototype Big Daddy.', 'title': 'Big Daddy (BioShock)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Sega All Stars was Sega\'s budget series for the Dreamcast, similar to Platinum Hits, Greatest Hits, and Player\'s Choice, for games that have sold many copies. When a title became a Sega All Stars title, it was sold at a lower price ($19.95) and given reprinted labeling. Sega All Stars was exclusive to North America, game covers were given an orange bar (as opposed to Europe\'s blue color scheme) with the brand name written from top to bottom. The disc labels were also changed to include a small circle and the Sega All Stars brand printed inside of it. 17 titles were made into Sega All Stars titles. Also, in printing, original releases said "Sega Dreamcast" on the disc but the All-stars versions just simply said "Dreamcast" to match up games released with the black label like "D2", "Jet Set Radio", "Sega GT", and "Sonic Adventure 2". Original Dreamcast games were released in the white labels and said "Sega Dreamcast" on the inlay like the Sega All-stars labels.', 'title': 'Sega All Stars'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Hit-Girl (Mindy McCready (comic) or Macready (film)) is a fictional character appearing in the "Kick-Ass" series, published by Marvel Comics under the company\'s imprint Icon Comics. The character was created by artist John Romita, Jr. and writer Mark Millar. She is a young but effective vigilante, trained by her father Damon McCready (a.k.a. Big Daddy) from an early age to be a costumed superhero and assassin. In "Kick-Ass", she is introduced as a supporting character. She featured in her own self-titled comic book series, "Hit-Girl", which was first published on 27 June 2012. She is portrayed by Chloë Grace Moretz in the feature film adaptations "Kick-Ass" and "Kick Ass 2".', 'title': 'Hit-Girl'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Afro Samurai OST is the soundtrack of the television series "Afro Samurai". The album was produced by RZA of the Wu Tang Clan, and features big names such as Big Daddy Kane, Talib Kweli, Q-Tip, and GZA. Featuring the historic collaboration between Big Daddy Kane & GZA\xa0– "Cameo Afro," this album received great and positive reviews from many websites and magazines.', 'title': 'Afro Samurai: The Album'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Antonio Hardy (born September 10, 1968), better known by his stage name Big Daddy Kane, is a Grammy Award-winning American rapper and actor who started his career in 1986 as a member of the rap collective the Juice Crew. He is widely considered to be one of the most influential and skilled MCs in hip hop. The name Big Daddy Kane came from a variation on Caine, David Carradine\'s character from TV show Kung Fu and a character called "Big Daddy" Vincent Price played in the film "Beach Party".', 'title': 'Big Daddy Kane'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Suanfa tongzong (General Source of Computational Methods) is a mathematical text written by sixteenth century Chinese mathematician Cheng Dawei (1533–1606) and published in the year 1592. The book contains 595 problems divided into 17 chapters. The book is essentially general arithmetic for the abacus. The book was the main source available to scholars concerning mathematics as it developed in China’s tradition. Six years after the publication of Suanfa Tongzong, Cheng Dawei published another book titled "Suanfa Zuanyao" ("A Compendium of calculating Methods"). About 90% of the content of the new book came from the contents of four chapters of the first book with some rearrangement. It is said that when Suanfa Tongzong was first published, it sold so many copies that the cost of paper went up and the lucrative sales resulted in unscrupulous people beginning to print pirated copies of the book with many errors. it was this that forced the author to print an abridged version.', 'title': 'Suanfa tongzong'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'BioShock is a first-person shooter video game series developed by Irrational Games—the first under the name 2K Boston/2K Australia—and designed by Ken Levine. The first game in the series was released for the Windows operating system and Xbox 360 video game console on August 21, 2007 in North America, and three days later (August 24) in Europe and Australia. A PlayStation 3 version of the game, which was developed by 2K Marin, was released internationally on October 17, 2008 and in North America on October 21, 2008 with some additional features. The game was also released for the Mac OS X operating system on October 7, 2009. A version of the game for mobile platforms has also been developed by IG Fun. A sequel, "BioShock 2", was released on February 9, 2010. On August 12, 2010, Irrational Games unveiled a trailer for a new game titled "BioShock Infinite", released on March 26, 2013. With the release of "BioShock Infinite" selling over 11 million copies as of May 2015, the three games combined have more than 25 million copies sold.', 'title': 'BioShock (series)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Soul Supreme (real name David Åström), born 1983, is a hip hop producer from Sweden. He has worked with the likes of KRS-One, Pete Rock and Big Daddy Kane. In 2003 he released his debut and self-produced album “The Saturday Night Agenda” under the name Soul Supreme on the Boston based label Grit Records. The album featured KRS-One, Big Daddy Kane, Pete Rock, O.C. and many more. Later the same year he produced the entire mixtape "Soulmatic", a remixed version of Nas classic album "Stillmatic", which was released through hiphopsite.com. In 2004 he continued with another remix mixtape; Soul & Sense containing remixes on early Common material when Common still called himself Common Sense. This was in 2005 released on Nocturne as a CD entitled “Uncommonly Nasty: Remixed By Soul Supreme & Statik Selektah”. In 2006 he made URB Magazine’s list of the next 100 producers His production borrows heavily from, often pitched-up, soul samples; hence the name. He is signed to JuJu Publishing. Soul Supreme also makes more electro themed music (his own name of this style is rapclash) under the name Kocky. In 2007, Soul Supreme released an electro-house album called "Kingdome Come" under his alias Kocky. The album was released by La Vida Locash and features guest appearances by Timbuktu, Chords, Mapei, and Jens Lekman.', 'title': 'Soul Supreme'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Burning Red is the third album by the American groove metal band Machine Head. It is the band\'s second best selling album in the US, selling as many copies in three years as "Burn My Eyes" sold in almost eight years (1994–2002) . The album has sold over 134,000 copies in the US and it was certified silver in 2011 by the BPI for sales of 60,000 in the UK.', 'title': 'The Burning Red'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Saturday Show is Birmingham-based Central Television\'s flagship Saturday morning kids TV show which replaced their previous show Tiswas. It ran on ITV for two series between 1982 and 1984. It was originally planned that popular wrestler Big Daddy would host and that it would be called "Big Daddy\'s Saturday Show". A pilot show was recorded with Big Daddy presenting, assisted by Isla St Clair and short films were shot with Big Daddy to insert in the upcoming series; a trailer for "Big Daddy\'s Saturday Show", complete with logo was shown on ITV the Saturday morning before the show was due to air. It was then announced during the week that Big Daddy was dropping out and that Isla St Clair would now take the lead, with ex-Magpie host Tommy Boyd assisting and with Jeremy Beadle being used as an occasional "stand in" host. The actor David Rappaport was also a fixture playing the character "Shades", as was football legend Jimmy Greaves.', 'title': 'The Saturday Show (ITV TV series)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "J.B. Scott's was a nightclub located on Central Avenue in Albany, New York. Its capacity was approximately 700. It was open from 1979 to 1982 when it burned down. Its performers included U2, John Mellencamp, Bryan Adams, Thin Lizzy, Pat Benatar and Iggy Pop. In 1985 club owner Douglas Jacobs opened another nightclub in Albany named J.B.'s Theatre.", 'title': "J.B. Scott's"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Don Rittner is an American historian, archeologist, environmental activist, educator, and author living in the Capital District, Schenectady County, New York. He is the former Schenectady County Historian, responsible for providing guidance and support to municipal historians and serving as a conduit between the State Historian in Albany and the local historians in their counties. He is also the former Schenectady City Historian and was the Albany City Archeologist (1973-79). He is the author of more than 35 books on history, natural history, computers, and other subjects, and has been collected by libraries worldwide.', 'title': 'Don Rittner'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The New York Buzz was a professional tennis team competing in World TeamTennis (WTT). The team was originally based in Schenectady, New York from 1995 to 2007, before moving to Albany, New York in 2008, and Guilderland, New York in 2009. The team was founded as the New York OTBzz in 1995, before changing its name to the Schenectady County Electrics in 1999, and finally adopting the name New York Buzz in 2001. In 2008, the team won its third Eastern Conference Championship and went on to defeat the Kansas City Explorers to capture its first and only King Trophy in its fourth appearance in the WTT Final.', 'title': 'New York Buzz'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The School Of Alternatives, also known as The HUB, is an alternative school in Jackson County, North Carolina for grades K–12 which deals with students who are disabled or have social/behavioral issues in the other county schools. It opened in the old Scotts Creek School, built in 1951, in 2002 after the new Scotts Creek Elementary School opened in 2001. The building received several renovations when it was converted into the HUB. It is the oldest school building still in use as a school in the county. It is located on old US 19/23 in the Addie Community and the playgrounds border Scotts Creek. When it opened it was a state-of-the-art facility, and didn't require blinds because the building was positioned at such an angle that the sun would always be overhead and would never directly shine into the classrooms windows. The building has two floors on the backside and one floor on the front. A small addition was added to the middle section of the school in the 1970s or 1980s. The Gym/Auditorium is small by modern standards, as the sideline was the wall. The new school that replaced Scotts Creek has a separate Gym and Auditorium, both of which are relatively large when compared to the old Gym/Auditorium. The HUB also takes in many High School students who either get in fights or have alcohol/drug problems.", 'title': 'School of Alternatives'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Schenectady County Historical Society, located in Schenectady, New York, was established on July 14, 1905, under the Membership Corporation Laws of the State of New York. The Society is an independent not-for-profit corporation, not a unit of government. Its stated mission as embodied in its constitution was, and remains, “to promote and encourage original historical research; to disseminate a greater knowledge of the history of the State of New York and particularly of Schenectady County; to gather, preserve, display, and make available for study artifacts, books, manuscripts, papers, photographs and other records and materials relating to the early and current history of Schenectady County, New York and of the surrounding area; to encourage the suitable marking of places of historic interest; to acquire by purchase, gifts, devise, or otherwise the title to or the custody and control of historic sites and structures.”', 'title': 'Schenectady County Historical Society'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Schenectady ( ) is a city in Schenectady County, New York, United States, of which it is the county seat. As of the 2010 census, the city had a population of 66,135. The name "Schenectady" is derived from a Mohawk word "skahnéhtati" meaning "beyond the pines". The city was founded on the south side of the Mohawk River by Dutch colonists in the 17th century, many from the Albany area. They were prohibited from the fur trade by the Albany monopoly, which kept its control after the English takeover in 1664. Residents of the new village developed farms on strip plots along the river.', 'title': 'Schenectady, New York'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Schenectady County ( ) is a county located in the U.S. state of New York. As of the 2010 census, the population was 154,727. The county seat is Schenectady. The name is from a Mohawk language word meaning "on the other side of the pine lands," a term that originally applied to Albany.', 'title': 'Schenectady County, New York'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'New York State Route\xa0160 (NY\xa0160) is a north–south state highway mostly located within Schenectady County, New York, in the United States. The southern terminus of the route is at an intersection with NY\xa0159 in the Duanesburg hamlet of Mariaville Lake. Its northern terminus is at a junction with NY\xa05S in the Rotterdam hamlet of Pattersonville. While its termini are both in Schenectady County, it briefly passes into Montgomery County near its midpoint.', 'title': 'New York State Route 160'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Schenectady County Airport (IATA: SCH,\xa0ICAO: KSCH,\xa0FAA LID: SCH) is a county owned, public use airport located three\xa0nautical miles (6\xa0km) north of the central business district of Schenectady, a city in Schenectady County, New York, United States. It is included in the National Plan of Integrated Airport Systems for 2011–2015, which categorized it as a "reliever airport".', 'title': 'Schenectady County Airport'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Central Avenue, in Albany, New York, is an 11-mile (5\xa0km) stretch in Albany County, of the 16-mile Albany-Schenectady Turnpike, which runs from Lark Street in the city of Albany, westward through the towns of Colonie, New York and Niskayuna, New York, to the city of Schenectady, New York. In the city of Albany it is called Central Avenue, in Colonie it is known as Central Avenue or Albany Schenectady Road, and in Schenectady County (Niskayuna and Schenectady) it is called State Street. The entire route is also called Route 5.', 'title': 'Central Avenue (Albany, New York)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Burbo Bank Offshore Wind Farm is a 348 MW offshore wind farm located on the Burbo Flats in Liverpool Bay on the west coast of the UK in the Irish Sea. It consists of an original 90 MW wind farm commissioned in 2007 and a 258 MW extension completed in 2017.', 'title': 'Burbo Bank Offshore Wind Farm'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Arklow Bank Wind Park is a 25\xa0megawatt offshore wind farm generating electrical power for the Wicklow region in Ireland. It is the first offshore wind farm in Ireland, and the world's first erection of wind turbines rated over 3 MW.", 'title': 'Arklow Bank Wind Park'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Walney Wind Farm is an offshore wind farm 14\xa0km west of Walney Island off the coast of Cumbria, in the Irish Sea, England. It has a capacity of 367\xa0MW, which makes it one of the world's largest offshore wind farms. The wind farm was developed by Walney (UK) Offshore Windfarms Limited, a partnership between DONG Energy and Scottish and Southern Energy. The farm is immediately north west of the West of Duddon Sands Wind Farm and also to the west of Ormonde Wind Farm. The farm is in water depths ranging from 19m to 23m and covers an area of approximately 73\xa0km.", 'title': 'Walney Wind Farm'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Liverpool Bay is a bay of the Irish Sea between northeast Wales, Cheshire, Lancashire and Merseyside to the east of the Irish Sea. The bay is a classic example of a region of freshwater influence. Liverpool Bay has historically suffered from reduced oxygen content from prior massive discharges of sewage sludge, according to C.Michael Hogan.', 'title': 'Liverpool Bay'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Vindeby Offshore Wind Farm was the first offshore wind farm in the world, made in 1991.', 'title': 'Vindeby Offshore Wind Farm'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Offshore wind power is in the early stages of development in the United States. In 2016, the first offshore wind farm started operation at Block Island Wind Farm off the coast of Rhode Island. Other projects are under development in wind-rich areas of the East Coast, Great Lakes, and Pacific coast. In January 2012, a "Smart for the Start" regulatory approach was introduced, designed to expedite the siting process while incorporating strong environmental protections. Specifically, the Department of Interior approved “wind energy areas” off the coast where projects can move through the regulatory approval process more quickly.', 'title': 'List of offshore wind farms in the United States'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Anholt Offshore Wind Farm is a Danish offshore wind power wind farm in the Kattegat, between Djursland and Anholt island. With a nameplate capacity of 400\xa0megawatts (MW), it is the third largest offshore wind farm in the world (along with BARD Offshore 1) and the largest in Denmark. A cable from the wind farm to Anholt replaces most of the diesel-powered electricity on the island.', 'title': 'Anholt Offshore Wind Farm'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Thanet Wind Farm (also sometimes called Thanet Offshore Wind Farm) is an offshore wind farm 7 mi off the coast of Thanet district in Kent, England. On commisioning it was the world's largest offshore wind farm. It has a nameplate capacity (maximum output) of 300\xa0MW and it cost £780–900\xa0million (US$1.2–1.4\xa0billion). Thanet is one of fifteen Round\xa02 wind projects announced by the Crown Estate in January 2004 but the first to be developed. It was officially opened on 23\xa0September 2010, when it overtook Horns Rev 2 as the biggest offshore wind farm in the world. It has since been overtaken by many others (medio 2017 it ranks 14th).", 'title': 'Thanet Wind Farm'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Rhyl Flats Offshore Wind Farm is a 25 turbine wind farm approximately 8\xa0km north east of Llandudno in North Wales. It is Wales' second offshore wind farm and the third offshore wind farm to be built within Liverpool Bay. It has a maximum rated output of 90\xa0MW.", 'title': 'Rhyl Flats'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "North Hoyle Offshore Wind Farm is Wales' first offshore wind farm, and the UK's first major offshore renewable power project. Situated in Liverpool Bay, it commenced operation in 2003.", 'title': 'North Hoyle Offshore Wind Farm'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'TPR Storytelling (Teaching Proficiency through Reading and Storytelling or TPRS) is a method of teaching foreign languages. TPRS lessons use a mixture of reading and storytelling to help students learn a foreign language in a classroom setting. The method works in three steps: in step one the new vocabulary structures to be learned are taught using a combination of translation, gestures, and personalized questions; in step two those structures are used in a spoken class story; and finally, in step three, these same structures are used in a class reading. Throughout these three steps, the teacher will use a number of techniques to help make the target language comprehensible to the students, including careful limiting of vocabulary, constant asking of easy comprehension questions, frequent comprehension checks, and very short grammar explanations known as "pop-up grammar". Many teachers also assign additional reading activities such as free voluntary reading, and there have been several easy novels written by TPRS teachers for this purpose.', 'title': 'TPR Storytelling'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': '"The Monkey Suit" is the twenty-first episode of the seventeenth season of the American animated sitcom "The Simpsons". It originally aired on the Fox network in the United States on May 14, 2006. In the episode, Ned Flanders is shocked after seeing a new display at the museum about evolution. Together with Reverend Lovejoy, he spreads the religious belief of creationism in Springfield, and at a later town meeting, teaching evolution is made illegal. As a result, Lisa decides to hold secret classes for people interested in evolution. However, she is quickly arrested and a trial against her is initiated.', 'title': 'The Monkey Suit'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'First Church of Christ, Scientist Building is an historic Christian Science church located at 1519 East Denny Way / 1841 16th Avenue on the corner of East Denny Way and 16th Avenue in the Capitol Hill neighborhood of Seattle, Washington. Designed in the Classical Revival style, it was built of Bedford limestone between 1906 and 1909. Established in August 1896, First Church first held services in various rented buildings or halls until building its first church building on the corner of 6th Avenue and Marion Street. This was completed in time for its first service on Easter Sunday, April 7, 1901. This was soon outgrown and in November 1906 a contract was signed to purchase the Denny Way property. In August 1908, services began in a temporary wooden structure that was built on the completed foundation of the new church. On January 17, 1977 the building was declared a City of Seattle historic landmark. In 2006 the congregation made the decision to move to the South Lake Union neighborhood to be in a more active urban location. The building on East Denny Way was sold to a developer who has since converted it into townhouse project called The Sanctuary. First Church of Christ, Scientist, Seattle, now holds services at 900 Thomas Street and is still an active branch of the Christian Science Mother Church.', 'title': 'First Church of Christ, Scientist (Seattle)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Old Donation Church is the third Lynnhaven Parish Church and is the oldest Episcopal Church in Virginia Beach. Records show that the parish’s first church services were held in 1637 in the home of Adam Thoroughgood. The first church building was constructed on Mr. Thoroughgood’s land in 1639 on the location later known as "Church Point." The vestry, or governing body of the church, was established in 1640.', 'title': 'Old Donation Episcopal Church'}
