 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Reverend Timothy "Tim" Lovejoy is a recurring character in the animated television series "The Simpsons". He is voiced by Harry Shearer, and first appeared in the episode "The Telltale Head". Lovejoy is the minister at The First Church of Springfield—the Protestant church in Springfield. Initially kind-hearted and ambitious, Lovejoy has become apathetic towards others because of Ned Flanders\'s constant asinine scrupulosity.', 'title': 'Reverend Lovejoy'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'First Church is a member church of the Reformed Church in America (RCA) and was one of the first churches in Jasper County, Indiana. It holds two worship services  on Sunday mornings. Its full name is "First Reformed Church of DeMotte," but goes by the shortened name First Church. In May 2016 First Church changed locations to Wheatfield, IN.', 'title': 'First Church (Demotte, Indiana)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Wright v. Houston Independent School District was a 1972 American legal case brought by a parent of a student in the Houston Independent School District in Houston, Texas suing on behalf of her daughter and fellow students to prevent the district from teaching evolution as fact and without reference to alternative theories. The plaintiffs claimed evolutionary theory endorsed a secularist religious view, and argued the school\'s failure to incorporate the teaching of a particular religious alternative to evolutionary theory as derived from the Bible\'s creation account held that religious view up to ridicule and contempt. To allow evolution while avoiding creationism was unconstitutional, the suit claimed, because it advanced one particular sectarian view over another. The plaintiffs maintained that the school\'s evolutionary teaching constituted "the establishment of a sectarian, atheistic religion" and was an interference of their own rights to the free exercise of religion as guaranteed by the Establishment clause in the First Amendment to the Constitution of the United States. The case is one of a series of legal battles over the teaching of evolution in American public schools, and the first to be initiated by opponents of such teaching.', 'title': 'Wright v. Houston Independent School District'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'First Church UCC (or “First Church,” or “First Church Sandwich,” or “First Church of Christ”) is a Congregational church in Sandwich Massachusetts founded in 1638 under Plymouth Colony Charter and the Mayflower Compact. It is either the oldest church on Cape Cod or the second oldest depending on the interpretation. First Church boasts Mayflower Pilgrims and their first-generation descendants as charter members. By Plymouth Colony Charter, a church was required as an official part of the governance of any newly founded township, and First Church was founded as the official church within the town of Sandwich. First Church is now a congregation of the United Church of Christ, a large theologically and socially liberal denomination. The Church is Open and Affirming – an appellation signifying both openness to and active affirmation of all persons regardless of status (and including LGBTQI persons). First Church is well known to tourists because of the inclusion of its current steeple on the cover of Elvis Presley\'s "How Great Thou Art" Gospel Album .', 'title': 'First Church, Sandwich Massachusetts'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'First Church, Old First Church, or First Church Parsonage may refer to:', 'title': 'First Church'}]

