 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The eighth and final season of "House" was ordered on May 10, 2011. It premiered on October 3, 2011. It was the only season not to feature Lisa Edelstein as Dr. Lisa Cuddy. Olivia Wilde (Dr. Remy "Thirteen" Hadley) also left the show after the third episode in order to further her film career, although she returned at the end of the series. On January 8, 2012, Kevin Reilly (Fox President of Entertainment) stated that Fox had been "avoiding" a decision on the fate of the series, as it was "hard to imagine the network without "House"" and that the decision on the future of the series would be a "close call". Hugh Laurie\'s contract on "House" expired once the eighth season was over, and Laurie confirmed that once "House" was over, he would be moving on to strictly film roles. On February 8, 2012, in a joint statement issued by Fox and executive producers David Shore, Katie Jacobs, and Hugh Laurie, it was revealed that the season would be the last for "House".', 'title': 'House (season 8)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'A television pilot (also known as a pilot or a pilot episode and sometimes marketed as a tele-movie) is a standalone episode of a television series that is used to sell the show to a television network. At the time of its creation, the pilot is meant to be the testing ground to gauge whether a series will be successful, and is therefore a test episode of an intended television series. It is an early step in the development of a television series, much like pilot studies serve as precursors to the start of larger activity. In the case of a successful television series, the pilot is commonly the very first episode that is aired of the particular series under its own name. A "back door pilot", is an episode of an existing successful series, that features future tie-in characters of an up-and-coming television series or film. The purpose of the "back door pilot" is to introduce the characters to an audience before the creators decide on whether they want to pursue a spin-off series with those characters or not.', 'title': 'Television pilot'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': '"Pilot" is the pilot episode of the American television sitcom "Cougar Town", which premiered on ABC on September 23, 2009. The episode was directed by series creator Bill Lawrence, and written by Lawrence and Kevin Biegel. The pilot introduces seven main cast members: Jules Cobb (Courteney Cox) as a 40-year-old mother who’s newly single; Ellie Torres (Christa Miller), Jules\' next door neighbor and best friend; Laurie Keller (Busy Philipps), Jules\' younger employee; Bobby Cobb (Brian Van Holt), Jules\' unemployed ex-husband; Travis Cobb (Dan Byrd), Jules\' 17-year-old son; Andy Torres (Ian Gomez), Ellie\'s husband; and Grayson Ellis (Josh Hopkins), Jules\' newly divorced neighbor.', 'title': 'Pilot (Cougar Town)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Conan The Adventurer is a weekly one hour American television live action-adventure series. It was produced by Max A. Keller and Micheline Keller from 1997 to 1998 and loosely based on the fantasy hero Conan the Barbarian. The TV show premiered on September 22, 1997. It comprised 22 episodes and was filmed mainly in Puerto Vallarta, Jalisco, Mexico. The series has reached many countries of the world, more than 150. Keller Entertainment Group, the same production company responsible for the series "" and "Acapulco H.E.A.T.", continues to market and distribute the series worldwide and the series has longevity among international broadcasters and DVD aggregators. The role of Conan was played by Ralf Moeller (AKA Rolf Muller), two time Mr. Universe, a native of Germany, and friend to Arnold Schwarzenegger. The rest of the ensemble cast included Danny Woodburn (Otli), Robert McRay (Zzeben), T.J. Storm (Bayu), Aly Dunne (Karella), and briefly, Andrew Craig (Vulkar). The script for the 2 hour pilot was written by Steve Hayes, the head of Project Development for the series. The show was not promoted to be "authentic Conan", but rather a mixture of Arnold Schwarzenegger\'s and John Milius\' interpretation of Conan. Indeed, the storyline deviated from the essence of the Conan character, as well as that of the Conan earlier depicted in the various Conan comic book series by Marvel Comics, because the adaptation was too peaceful and childish.', 'title': 'Conan the Adventurer (1997 TV series)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Elizabeth Jean "Busy" Philipps (born June 25, 1979) is an American actress, known for her supporting roles on the television series "Freaks and Geeks" and "Dawson\'s Creek". She has also performed significant roles in films like "The Smokers" (2000), as Karen Carter, the drama film "Home Room" (2002) as Alicia Browning, she appeared in "White Chicks" (2004), played a supporting role in "Made of Honor" (2008) and appeared in "He\'s Just Not That Into You" (2009). She played Laurie Keller in the TV series "Cougar Town" for which she won the Critics\' Choice Television Award for Best Supporting Actress in a Comedy Series in 2011.', 'title': 'Busy Philipps'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Dr. Jennifer Keller is a fictional character from the Canadian-American military science fiction series "Stargate Atlantis", a spin-off series to "Stargate SG-1". She is played by Canadian actress Jewel Staite, who previously played the Wraith Ellia in season two episode "Instinct". She was created by the producers, who wanted someone to fill in for Carson Beckett after Paul McGillion\'s departure from regular status in the series. Keller had a recurring role in the fourth season, and was later promoted to a regular in Season 5.', 'title': 'Jennifer Keller'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Zosia March (also Valentine) is a fictional character from the BBC medical drama "Holby City", played by actress Camilla Arfwedson. She first appeared in the series fifteen episode "The Kick Inside", broadcast on 10 September 2013. Zosia arrives at Holby City hospital to start her first year of the Foundation Programme. Zosia has vested interest in psychiatry and has worked on both Darwin and Keller wards mentored by Elliot Hope (Paul Bradley) and Sacha Levy (Bob Barrett) respectively. She is characterised as a forthright, intelligent and unafraid to challenge the hospital hierarchy. The show soon introduced Zosia\'s estranged father, Guy Self (John Michie). They share a dysfunctional relationship following the death of her mother. Their feud jeopardises Zosia\'s career and on one occasion she is thrown off Keller following a rude confrontation. Other storylines revolve around close colleagues Arthur Digby (Rob Ostlere) and Dominic Copeland (David Ames) and romances with Sebastian Coulter (Hadley Fraser) and Oliver Valentine (James Anderson), whom she later married.', 'title': 'Zosia March'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Crystal Cube was a mockumentary television pilot written by and starring Stephen Fry and Hugh Laurie, broadcast on 7 July 1983 on BBC2 at 22:10. The pilot was one of Fry and Laurie\'s first television appearances and the first show they had written themselves. However, the BBC chose not to take it to a full series, and Fry and Laurie did not get a chance to make their own programme for the BBC until 1989, when they produced their first full series of the more conventional sketch show "A Bit of Fry and Laurie", after a pilot in 1987.', 'title': 'The Crystal Cube'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Yangzhou Taizhou International Airport (IATA: YTY,\xa0ICAO: ZSYA) , often abbreviated to Yangtai Airport, is an airport serving the cities of Yangzhou and Taizhou in China's Jiangsu Province. It is located in the town of Dinggou in Jiangdu District, Yangzhou, 30 kilometers from the center of Yangzhou and 20 kilometers from Taizhou. Another major city, Zhenjiang, is also nearby across the Yangtze River.", 'title': 'Yangzhou Taizhou International Airport'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Yangzhou, formerly romanized as Yangchow, is a prefecture-level city in central Jiangsu Province, China. Sitting on the north bank of the Yangtze, it borders the provincial capital Nanjing to the southwest, Huai'an to the north, Yancheng to the northeast, Taizhou to the east, and Zhenjiang across the river to the south. Its population was 4,414,681 at the 2010 census and its urban area is home to 2,146,980 inhabitants, including three urban districts, currently in the agglomeration.", 'title': 'Yangzhou'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Kingdom of Croatia (Latin: "Regnum Croatiae" ; Croatian: "Kraljevina Hrvatska, Hrvatsko Kraljevstvo" ) was a medieval kingdom in Central Europe comprising most of what is today Croatia (without most of Istria and some Dalmatian coastal cities), as well as most of the modern-day Bosnia and Herzegovina. The Kingdom existed as a sovereign state for nearly two centuries. Its existence was characterized by various conflicts and periods of peace or alliance with the Bulgarians, Byzantines, Hungarians, and competition with Venice for control over the eastern Adriatic coast. The goal of promoting the Slavic language in the religious service was initially brought and introduced by the 10th century bishop Gregory of Nin, which resulted in a conflict with the Pope, later to be put down by him. In the second half of the 11th century Croatia managed to secure most coastal cities of Dalmatia with the collapse of Byzantine control over them. During this time the kingdom reached its peak under the rule of kings Peter Krešimir IV (1058-1074) and Demetrius Zvonimir (1075-1089).', 'title': 'Kingdom of Croatia (925–1102)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Shengao () is a town in Jiangyan District, Taizhou, south-central Jiangsu province, China. It is called the "hometown of fish and rice" because of the high quality of the fish and rice production in the town. It is among the first of the opening cities designated by the State Council of China.', 'title': 'Shengao'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'This list ranks U. S. cities by land area. Total areas including water are also given, but note that, when ranked by total area, a number of coastal cities appear disproportionately larger. San Francisco is an extreme example: water makes up nearly 80% of its total area of 232 square miles (601\xa0km²). Note also that in many cases a city may be geographically large primarily because its municipal government has merged with the government of the surrounding county. In some cases the county no longer exists, while in others the arrangement has formed a Consolidated city–county (or city-borough in Alaska, or city-parish in Louisiana); these are shown in bold. Cities that are not consolidated with or part of any county are independent cities, indicated thus <nowiki>**</nowiki>. All data is from the 2010 United States Census.', 'title': 'List of United States cities by area'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'State Road A1A (SR\xa0A1A) is a north-south Florida State Road that runs along the Atlantic Ocean, from Key West at the southern tip of Florida, to Fernandina Beach, just south of Georgia on Amelia Island. It is the main road through most oceanfront towns. Part of SR A1A is designated the A1A Scenic and Historic Coastal Byway, a National Scenic Byway. A portion of A1A that passes through Volusia County is designated the Ormond Scenic Loop and Trail, a Florida Scenic Highway. It is also called the Indian River Lagoon Scenic Highway from State Road 510 at Wabasso Beach to U.S. Route 1 in Cocoa. A1A is famous worldwide as the center of beach culture in the United States, a scenic coastal route through most Atlantic coastal cities and beach towns, including the unique tropical coral islands of the Florida Keys. A1A also serves as a major thoroughfare through Miami Beach and other south Florida coastal cities.', 'title': 'Florida State Road A1A'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Dalun () is a town of Jiangyan District, Taizhou in south-central Jiangsu province, China. , it has 2 residential communities (社区) and 16 villages under its administration.', 'title': 'Dalun, Jiangsu'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Jiangyan District () is one of three urban districts of the city of Taizhou, Jiangsu province, China, having been, until December 2012, a county-level city. Jiangyan is noted for being the birthplace of the former General Secretary of the Communist Party of China Hu Jintao.', 'title': 'Jiangyan District'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Laurentide Ice Sheet was a massive sheet of ice that covered millions of square kilometers, including most of Canada and a large portion of the northern United States, multiple times during the Quaternary glacial epochs— from 2.588\xa0± 0.005 million years ago to the present. The last advance covered most of northern North America between c. 95,000 and c. 20,000 years before the present day, and among other geomorphological effects, gouged out the five Great Lakes and the hosts of smaller lakes of the Canadian shield. These lakes extend from the eastern Northwest Territories, through most of northern Canada, and the upper Midwestern United States (Minnesota, Wisconsin, and Michigan) to the Finger Lakes, through Lake Champlain and Lake George areas of New York, across the northern Appalachians into and through all of New England and Nova Scotia. At times, the ice sheet's southern margin included the present-day sites of northeastern coastal towns and cities such as Portsmouth, New Hampshire, Boston, New York City, and Great Lakes coastal cities and towns as far south as Chicago and St. Louis, Missouri—and then followed quite precisely the present course of the Missouri River up to the northern slopes of the Cypress Hills, beyond which it merged with the Cordilleran Ice Sheet. The ice coverage extended approximately as far south as 38 degrees latitude in the mid-continent.", 'title': 'Laurentide Ice Sheet'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Shenge is a coastal town on the Atlantic ocean; it is the seat of the Kagboro chiefdom, one of several in Moyamba District in the Southern Province of Sierra Leone. Due to the dense coastal jungle and poor road network, the town of Shenge is most easily reached by boat. "Pampa" is the name given to the boats that travel among the coastal cities.', 'title': 'Shenge'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Lauren Fleshman (born September 26, 1981) is a former American track and field athlete. She was the U.S. 5000 meters champion in 2006 and 2010, and has competed at the IAAF World Championships in Athletics in 2003, 2005, and 2011. In the 5000 meter final of the 2011 IAAF World Championships she finished 7th place, equaling what was at the time the highest ever finish by an American woman in that event (in 2013 Molly Huddle finished 6th).', 'title': 'Lauren Fleshman'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Kenia Sinclair (born July 14, 1980) is a Jamaican athlete competing over 800 metres. Kenia first broke onto the international scene in 2005. On June 12 Sinclair broke Inez Turner's 10-year-old record to become the 5th Jamaican woman to go under two minutes. Less than a month later Kenia again broke the Jamaican record lowering the mark to 1.58.88. Kenia narrowly missed out on reaching the 800m final at the 2005 IAAF World Championships after finishing 3rd in her semi-final. In early 2006 Sinclair gained a silver in the IAAF World Indoor Championships breaking the Jamaican Indoor Record. In March at the 2006 Commonwealth Games Kenia earned a silver medal beating her hero Maria de Lurdes Mutola and once again breaking the national record. Kenia set her most recent National record of 1:57.88 in Crete, Greece. At the 2007 IAAF World Championships Kenia was once again knocked out in the semi-finals but many believe her performance was affected by the death of her coach. Kenia Sinclair is one of Jamaica greatest ever 800m runners and has broken the barriers of Jamaican female middle distance running. Kenia made the 2008 Olympic 800m final but she mistimed her run and finished 6th with a season's best of 1:58.24.", 'title': 'Kenia Sinclair'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'In 2014 there was no primary outdoor global athletics championship, as neither the Summer Olympics nor the World Championships in Athletics occurred in the year. The 2014 IAAF World Indoor Championships, and the 2014 IAAF Continental Cup were the foremost global events to be held in 2014. The 2014 IAAF World Relays marked the debut of the new international competition exclusively for relay races.', 'title': '2014 in athletics (track and field)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The seventeenth edition of the IAAF World Championships is scheduled to be held in 2019 in Doha, Qatar at the renovated Khalifa International Stadium, a 48,000 -seat multi-purpose stadium.', 'title': '2019 World Championships in Athletics'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'In 2012 the foremost competition in athletics was the 2012 Summer Olympics in London. The International Association of Athletics Federations held four other global level competitions in 2012: the 2012 IAAF World Indoor Championships, 2012 IAAF World Race Walking Cup, 2012 World Junior Championships in Athletics and the 2012 IAAF World Half Marathon Championships.', 'title': '2012 in athletics (track and field)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Australian Athletics Team has been known as the "Australian Flame" since 2009. The team participates in several world multi-event athletics competitions: Summer Olympics, IAAF World Championships, IAAF World Indoor Championships and the Commonwealth Games. Australia also participates in specific event world championships including IAAF World Cross Country Championships and IAAF World Race Walking Cup.', 'title': 'Australian Athletics Team'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Ilya Yuryevich Shkurenyov (Russian: Илья Юрьевич Шкуренёв ; born 11 January 1991) is a Russian decathlete. His personal best score is 8538 points, achieved at the 2015 IAAF World Championships in Beijing. He was second at IAAF World Junior Championships in 2010, 4th at IAAF World Indoor Championships 2012 in heptathlon.', 'title': 'Ilya Shkurenyov'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Emanuele Fuamatu (born 27 October 1989) is a Samoan athlete. He competed for Samoa in shot put at the 2012 Summer Olympics where he did not advance to the final. Emanuele Fuamatu competed for Australia at the 2005 IAAF World Youth Championships, 2006 IAAF World Junior Championships, and the 2008 IAAF World Junior Championships. Emanuele Fuamatu was a recipient of the International Olympic Committee Solidarity Scholarship. He holds the current Male NSW Under 16, Under 18, Under 20, and Open Shot Put Records. He is the current Oceania and Australian Champion in the Men's Shot Put. Emanuele Fuamatu won the Shot Put in the Australian Junior Championships in 2005, 2006, 2007 and 2008. His 20.54 metre effort with the 6\xa0kg as a junior ranked him third worldwide in 2008. He attends University in Sydney, Australia, majoring in Law.", 'title': 'Emanuele Fuamatu'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The IAAF World U20 Championships (formerly named the IAAF World Junior Championships in Athletics up to November 2015) are the world championships for junior aged athletes (19 years old or younger on 31 December in the year of the competition), organized by the International Association of Athletics Federations. It is held biennially since 1986.', 'title': 'IAAF World U20 Championships'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': "Khalifa International Stadium (Arabic: ملعب خليفة الدولي\u200e \u200e ) also known as National Stadium is a multi-purpose stadium in Doha, Qatar as part of the Doha Sports City complex, which also includes Aspire Academy, Hamad Aquatic Centre, and the Aspire Tower. It is named after Khalifa bin Hamad Al Thani, Qatar's former Emir. The final of 2011 AFC Asian Cup was held at this stadium.", 'title': 'Khalifa International Stadium'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Mark Robert Bowden (born July 17, 1951) is an American writer and author. He is a National Correspondent for The Atlantic and a contributing editor at "Vanity Fair". Born in St. Louis, Missouri, he is a 1973 graduate of Loyola University Maryland. While at Loyola, he was inspired to embark on a journalistic career by reading Tom Wolfe\'s book "The Electric Kool-Aid Acid Test". In 2010, in his acceptance speech for a lifetime achievement award at the National Book Awards, Wolfe called Bowden one of the two "writers to watch" (along with Michael Lewis).', 'title': 'Mark Bowden'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Roger Hunt, MBE (born 20 July 1938) is an English former footballer who played as a forward. He spent eleven years at Liverpool and became the club's record goalscorer with 286 goals, until it was surpassed by Ian Rush. Hunt remains Liverpool's record league goalscorer. Under Bill Shankly, Hunt won two league titles and an FA Cup. Regarded as one of Liverpool's greatest ever players, Hunt is referred to as Sir Roger by the club's fans. He was ranked 13th on the 100 Players Who Shook The Kop, an official fan poll.", 'title': 'Roger Hunt'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Alfonso G. Pablo Sr. (born September 29, 1939 in Camiling, Tarlac, Philippines) is a retired ordained Filipino Wesleyan clergyman who was General Superintendent of the Wesleyan Church of the Philippines from 1989 to 2005, and was the Chairman of the The International Conference of The Wesleyan Church (formerly Wesleyan World Fellowship) for four years from 2000. Pablo is currently General Superintendent "emeritus" of The Wesleyan Church of the Philippines, a distinguished professor at the Wesleyan Graduate School for Asia Pacific in Rosales, Pangasinan, adjunct professor at Asia-Pacific Nazarene Theological Seminary, and the chairman of Global Transformation Ministries (GTMI), and chairman of the Asia Evangelistic Fellowship Philippines (AEFP). Pablo has led various parachurch organizations in the evangelical community, including being the chairman of the Philippine Council of Evangelical Churches (PCEC). In 2010, Pablo published a book, "Transforming Leaders: The Filipino Church Administration".', 'title': 'Alfonso G. Pablo Sr.'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'William G. "Jerry" Boykin (born April 19, 1948) was the United States Deputy Undersecretary of Defense for Intelligence under President George W. Bush from 2002 to 2007 and retired general officer. During his 36-year career in the military he spent 13 years in the Delta Force and was involved in numerous high-profile missions, including the 1980 Iran hostage rescue attempt, the 1992 hunt for Pablo Escobar in Colombia, and the Black Hawk Down incident in Mogadishu, Somalia. He is an author and teaches at Hampden–Sydney College, Virginia. He is currently executive vice president at the Family Research Council.', 'title': 'William G. Boykin'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Killing Pablo: The Hunt for the World\'s Greatest Outlaw (2001) is a book by Mark Bowden that details the efforts by the governments of the United States and Colombia, their respective military and intelligence forces, and Los Pepes to stop illegal activities committed by Colombian drug lord Pablo Escobar and his subordinates. It relates how Escobar was killed and his cartel dismantled. Bowden originally reported this story in a 31-part series published in "The Philadelphia Inquirer" and in a companion documentary of the same title.', 'title': 'Killing Pablo'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Paul Hunt is a gymnastics coach and gymnastics clown. Hunt was born in Illinois, and now lives in Murray, Utah. He runs Hunt\'s Gymnastics Academy (a.k.a. Hunt\'s Gym) in Salt Lake City. Hunt has performed comedic performances of women\'s gymnastics routines, including the uneven bars, floor exercises, and the balance beam since 1980. He has performed on US and international television, including "Wide World of Sports" and "America\'s Funniest Videos".', 'title': 'Paul Hunt (gymnast)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Pablo Salvador is a Chilean gay activist and blogger born in Panama as Salvador Sepúlveda Montoya. Pablo is Master in Direction of Communication of Pompeu Fabra University, Barcelona, Spain and Professor of History and Management. The greatest success of Chile in a gay contest was in February 2011 when Pablo Salvador, Mr. Gay Chile 2009 - 2010, won the International Mr Gay Competition.', 'title': 'Pablo Salvador'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ennio Bolognini (November 7, 1893—July 31, 1979) was an Argentine-born American cellist, guitarist, composer, conductor, professional boxer, pilot, and flight instructor. Though seldom remembered today, during his lifetime his musical virtuosity was widely admired by his contemporaries. Pablo Casals praised him as "the greatest cello talent I ever heard in my life", and Gregor Piatigorsky told Christine Walevska\'s father, "No, I am not the greatest cellist in the world; neither is Feuermann. The greatest is the Argentine Bolognini!" (A similar quote has been elsewhere misattributed to Emanuel Feuermann)', 'title': 'Ennio Bolognini'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Greatest International Scavenger Hunt the World Has Ever Seen (GISHWHES, pronounced "gish-wes") is an annual week-long competitive media scavenger hunt originally held each October or November, but more recently each August. Teams of 15 competitors earn points for submitting photos and videos of themselves completing prompts from a list they receive at the beginning of the week. Actor Misha Collins officially founded GISHWHES in 2011 after a publicity stunt to help the television series "Supernatural" (on which Collins appears) win a People\'s Choice Award. The competition holds a world record for being the largest media scavenger hunt ever to take place, and several additional world records. On July 11th 2017, Collins announced that the 2017 hunt is to be the last iteration of GISHWHES in its current format.', 'title': 'GISHWHES'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Royal Calpe Hunt of the British Crown Colony of Gibraltar originated in 1812 as the Civil Hunt. The fox hunt was initially a civilian endeavour that began when a pair of English foxhounds were imported to Gibraltar. The hunts took place across the border, in the Campo de Gibraltar area of Spain. However, in 1814, the membership of the Hunt underwent a substantial change. Many officers of the Gibraltar garrison joined the Hunt, which shifted from a civilian to a military enterprise. That year, the name was changed to the Civil Calpe Hunt. It retained that title until 1817, after which it was known as the Calpe Hunt. The first Master of the Hunt was Charles Elphinstone Fleeming. However, the Master most associated with the Hunt was Pablo Larios, Marquis of Marzales, who held that title for forty-five years. His election to that position in 1891 was not only historic, but strategic. His appointment represented only the second time that the position had not been filled by a member of the military. In addition, his Spanish heritage and influence in the Campo de Gibraltar, where he owned extensive estates, garnered him the loyalty of the local Spanish farmers, and therefore eased the ever-present tensions between the military and the farmers over the crop damage that was inherent to the Hunt. In 1906, King Edward VII of the United Kingdom and King Alfonso XIII of Spain became joint Patrons of the Hunt, after which it was known as the Royal Calpe Hunt. The tradition of the Hunt continued for more than a century, until 1939, and the onset of the Second World War', 'title': 'Royal Calpe Hunt'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Ducking" is a prison slang term for a technique through which prisoners modify the behavior of correctional officers and other prison staff members using manipulation and coercion. The prison slang term for a prison staff member that has been manipulated is a "duck".', 'title': 'Ducking (slang)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Ghosts is a 2006 drama film directed by Nick Broomfield, based on the 2004 Morecambe Bay cockling disaster. The title is a reference to the Cantonese slang term "Gweilo" (鬼佬), meaning "ghost man", used for white people.', 'title': 'Ghosts (2006 film)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Shiv (possibly from the Romani word "chivomengro", "knife"), also "chiv", is a slang term for any sharp or pointed implement used as a knife-like weapon. The "Oxford English Dictionary" suggests "shive", a razor, documented in 1915, as the root word. In the 1920s, "shiv" was also a common slang term for a bladed weapon, mostly a knife. In the United States, an improvised prison knife is also often called a shank.', 'title': 'Shiv (weapon)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Gweilo or gwailou (, pronounced ] ) is a common Cantonese slang term for Westerners. In its unmodified form, it applies only to European ethnicities and has a history of racially deprecatory use. Cantonese speakers frequently use "gwailou" to refer to Westerners in general use, in a non-derogatory context, although whether this type of usage is offensive is disputed by both Cantonese and Westerners alike.', 'title': 'Gweilo'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Dongo may refer to: The mix between a dingo and any other dog is referred to as a "Dongo" and also is a slang term for male genitalia. Dongo is also reported to be, but is not widely used, as a slang term in Australia as a substitute for the color orange.', 'title': 'Dongo'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Zips (also Siggies or Geeps) is a slang term often used as a derogatory slur by Italian American and Sicilian American mobsters in reference to newer immigrant Sicilian and Italian mafiosi. The name is said to have originated from mobsters\' inability to understand the faster-speaking Sicilian dialects, which appeared to "zip" by. Other theories include pejorative uses such as Sicilians\' preference for silent, homemade zip guns. According to still another theory, the term is a contraction of the Sicilian slang term for "hicks" or "primitives." The older Sicilian mafiosi of pre-Prohibition known as "Mustache Petes" (who eventually were deposed by American-born mobsters during the Castellammarese War) were also referred to as zips.', 'title': 'Zips'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Sheng nu (剩女; shèngnǚ; common translation: "leftover women" or "leftover ladies") is a derogatory term made popular by the All-China Women\'s Federation that classifies women who remain unmarried in their late twenties and beyond. The term is most prominently used in China, including a state sponsored directive and program, but has been used to describe women across Asia, India, and North America. The term has gone on to become widely used in the mainstream media and has been the subject of several televisions series, magazine and newspaper articles, and book publications focusing on both the good and bad aspects of the term and surrounding culture. Xu Xiaomin of "The China Daily" described the sheng nus as "a social force to be reckoned with" while others have argued the term should be taken as a positive to mean "successful women". The slang term, 3S or 3S Women, meaning "single, seventies (1970s), and stuck" has also been used in place of sheng nu. The equivalent term for men, "guang gun" (光棍) meaning bare branches, is used to refer to men who do not marry and thus do not add \'branches\' to the family tree. Similarly, "shengnan" (剩男) or "leftover men" has also been used.', 'title': 'Sheng nu'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Beard is a slang term describing a person who is used, knowingly or unknowingly, as a date, romantic partner (boyfriend or girlfriend), or spouse either to conceal infidelity or to conceal one's sexual orientation. The American slang term originally referred to anyone who acted on behalf of another, in any transaction, to conceal a person's true identity. The term can be used in heterosexual and homosexual contexts, but is especially used within LGBT culture. References to beards are seen in mainstream television and films, and other entertainment.", 'title': 'Beard (companion)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Cantonese slang is a type of slang used in areas where Cantonese language is spoken.', 'title': 'Cantonese slang'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Shmohawk or schmohawk is a slang term that might have derived from "schmo", a slang term meaning "fool". The HBO television show "Curb Your Enthusiasm" gave the word recent notoriety, and HBO even sells a "Curb Your Enthusiasm" schmohawk mug. Earlier uses of the word can be found in the "Crusader Rabbit" animated cartoon "Crusader and the Schmohawk Indians", released in 1950 and in Saul Bellow\'s 1958 novel "Henderson the Rain King".', 'title': 'Shmohawk'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Church in the Darkness is an upcoming single-player action-adventure video game designed by Richard Rouse III and developed under the name Paranoid Productions. The game is expected to be launched in 2017 for PC (Steam), Mac OS, PlayStation 4 and Xbox One.', 'title': 'The Church in the Darkness'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Little Mermaid is an action game by Capcom for the NES and Game Boy. It is a single-player side-scrolling action game where the player controls Ariel on a quest to defeat the evil Ursula, the sea witch.', 'title': 'The Little Mermaid (video game)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Exile is a single-player action-adventure video game originally published for the Acorn Electron and BBC Micro in 1988 by Superior Software and later ported to the Commodore 64, Amiga, CD32 and Atari ST, all published by Audiogenic. Exile\'s game physics engine qualifies it to be the first game to have a complete Newtonian motion model. At the time of its release it was considered to push the boundaries of what was possible on home computers, particularly on the 8-bit platforms. It remains probably the most complex game available for the BBC Micro. The game was designed and programmed by Peter Irvin (author of "Starship Command", a space shoot-em-up with an innovative control system) and Jeremy Smith (author of "Thrust", a game based on cave exploration with a simpler physics model). It is also an early example of a Metroidvania.', 'title': 'Exile (1988 video game)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Alex Kidd in Shinobi World is a side-scrolling action game produced by Sega that was originally released for the Master System in 1990 and later re-released for the Wii Virtual Console in 2009 . Although developed in Japan, it was released exclusively for the overseas market (North America, Europe and Brazil). The game stars Alex Kidd in a parody version of Sega\'s ninja-themed action game "Shinobi", where Alex Kidd fights against caricatures of many of the enemies from "Shinobi". It is the final video game to star the Alex Kidd character.', 'title': 'Alex Kidd in Shinobi World'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Mobile Suit Gundam: Journey to Jaburo (Japanese: 機動戦士ガンダム めぐりあい宇宙 "Kidō Senshi Gandamu Meguriaiuchū", meaning "Mobile Suit Gundam: Space Encounters") is an action game based directly on the Mobile Suit Gundam films and series. The game begins at the start of the series and ends at the ending of the second film. The game plays in an action game format with a standard third person view. It features newly hand animated cutscenes that depict events from the original television series as well as a CGI opening depicting a space battle from the One Year War and then a scene of the Gundam destroying several Zaku IIs before being attacked by Char Aznable. It is also the prequel to "".', 'title': 'Mobile Suit Gundam: Journey to Jaburo'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'TMNT is a 2007 computer-animated fantasy action film written and directed by Kevin Munroe. Based on the "Teenage Mutant Ninja Turtles" comic book series, the film stars Chris Evans, Sarah Michelle Gellar, Mako, Kevin Smith, Patrick Stewart and Zhang Ziyi. Mako died in July 2006, making "TMNT" his final film role. The film is dedicated to him.', 'title': 'TMNT (film)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Teenage Mutant Ninja Turtles: Turtles in Time, released as Teenage Mutant Hero Turtles: Turtles in Time in Europe, is an arcade video game produced by Konami. A sequel to the original "Teenage Mutant Ninja Turtles" ("TMNT") arcade game, it is a scrolling beat \'em up type game based mainly on the 1987 "TMNT" animated series. Originally an arcade game, "Turtles in Time" was ported to the Super Nintendo Entertainment System in 1992 under the title Teenage Mutant Ninja Turtles IV: Turtles in Time, continuing the numbering from the earlier "Turtles" games released on the original NES. That same year, a game that borrowed many elements, "" was released for the Mega Drive/Genesis.', 'title': 'Teenage Mutant Ninja Turtles: Turtles in Time'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "TMNT is a single-player action-adventure multi-platform action game starring the Teenage Mutant Ninja Turtles. It is based on the 2007 film of the same name, and was released three days before the actual movie's release for the Xbox 360, Wii, PlayStation 2, Nintendo GameCube, Nintendo DS, and PlayStation Portable, as well as for the PC on March 20, 2007.", 'title': 'TMNT (video game)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Treasure Planet: Battle at Procyon is a PC strategy game, part of Disney\'s Action Game strand, which includes epic 3D ship battles. The game takes place five years after the events of the film, "Treasure Planet". The single-player campaign details the story of Jim Hawkins ascending the ranks as a naval officer, and an additional skirmish mode includes several historical and open-map skirmishes. Of note is the fact that the game actually states that no battle takes place at Procyon during the end credits, a disclaimer likely added due to the presence of younger players.', 'title': 'Treasure Planet: Battle at Procyon'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Disney\'s Mulan is a 1998 action video game based on the Disney film "Mulan", and released on the Game Boy. It is a part of the "Mulan" franchise. The action game is published by THQ and developed by Tiertex Design Studios. It was released on Oct 19, 1998.', 'title': "Disney's Mulan (video game)"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Fairleigh Dickinson Knights refer to the 17 sports teams representing Fairleigh Dickinson University's Metropolitan campus in Teaneck & Hackensack, New Jersey. Fairleigh Dickinson University or (FDU) offers a variety of sports on the Division I level. The Women's Bowling Team has won two national titles in 2006 & 2010 respectively. The men's basketball team has reached the NCAA Tournament five times in the history of the program (1985, 1988, 1998, 2005, & 2016). The Knights compete in the NCAA Division I and are members of the Northeast Conference.", 'title': 'Fairleigh Dickinson Knights'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Institute of Traditional Judaism, also known as the Metivta or the ITJ, is the rabbinical school sponsored by the Union for Traditional Judaism. The Metivta trains men for the rabbinate, and also offer study programs for men and women which do not lead to ordination. The ITJ offers a Masters in Public Administration jointly with Fairleigh Dickinson University.', 'title': 'Institute of Traditional Judaism'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Intercollegiate Horse Show Association (IHSA) was established in 1967 by Robert E. Cacchione, while a sophomore at Fairleigh Dickinson University in New Jersey and with the encouragement of History professor and noted horseman, Jack Fritz. IHSA is based on the principal that any college student, regardless of skill level, financial status, or riding experience, should have the opportunity to compete on a college equestrian team. IHSA offers numerous scholarship opportunities while emphasizing education, sportsmanship, and team spirit. IHSA  serves 400+ college and university teams across the United States and parts of Canada, with more than 8900 active riders. Collegiate equestrian, like Olympic equestrian competition, remains one of the only sports in the world where young women and men compete equally.', 'title': 'Intercollegiate Horse Show Association'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The Western Institute of Technology (also referred to as WIT) is an engineering college in Iloilo City, Philippines.', 'title': 'Western Institute of Technology (Philippines)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Colonel Fairleigh Stanton Dickinson Sr. (August 22, 1866 – June 23, 1948) was the co-founder of the Fortune 500 medical technology company Becton Dickinson and the named benefactor of Fairleigh Dickinson University.', 'title': 'Fairleigh S. Dickinson'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The Fairleigh Dickinson Knights men's basketball team represents Fairleigh Dickinson University in Hackensack, New Jersey, United States. The school's team currently competes in the Northeast Conference and plays their home games at the Rothman Center. FDU is currently coached by Greg Herenda.", 'title': "Fairleigh Dickinson Knights men's basketball"}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Fairleigh Dickinson University Press (FDU Press) is a publishing house under the operation and oversight of Fairleigh Dickinson University, the largest private university in New Jersey with international campuses in Vancouver, British Columbia and Wroxton, Oxfordshire.', 'title': 'Fairleigh Dickinson University Press'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Fairleigh Dickinson women's basketball team represents Fairleigh Dickinson University in Women's college basketball. Their colors are burgundy, white, and blue. This mid-major team competes in the Northeast Conference. The Knights host opponents in the Rothman Center, which can seat up to 6,000, in Hackensack, New Jersey. They are coached by Peter Cinella, who is in his 8th year.", 'title': "Fairleigh Dickinson Knights women's basketball"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Lehigh University Press is the publishing house of Lehigh University. Lehigh's university press was a member of the Associated University Presses consortium; other members included Bucknell University Press, University of Delaware Press, Susquehanna University Press and Fairleigh Dickinson University Press. When Associated University Presses ceased most new publishing in 2010, a new distribution agreement between Lehigh University Press, Bucknell University Press, University of Delaware Press, and Fairleigh Dickinson University Press was struck with Rowman & Littlefield.", 'title': 'Lehigh University Press'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Fairleigh Dickinson University is a private, coeducational and nonsectarian university founded in 1942. Fairleigh Dickinson University is the first American university to own and operate an international campus and currently offers more than 100 individual degree programs to its students. The school has four campuses, two in New Jersey (United States), and one each in Canada and the United Kingdom.', 'title': 'Fairleigh Dickinson University'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Michael Lent is a mixed media writer and producer based in Los Angeles. He is best known as the co-writer of "On Thin Ice", the memoirs of Hugh Rowland, one of the stars of the long-running series Ice Road Truckers.', 'title': 'Michael Lent (writer and producer)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'PrankStars was a 2011 American 6-episode reality television series that aired monthly and employed the use of a hidden camera. The series premiered on Disney Channel on July 15, 2011, and was hosted by "Pair of Kings" and "Hannah Montana" star, Mitchel Musso. The television program portrayed scenarios in which children and teenagers met their favorite stars in "unpredictable and humorous" settings that had been engineered by their friends and family. The show was Disney Channel\'s first reality series since the "Totally in Tune" show. In Canada, Family Channel aired two episodes of "PrankStars" on September 30, 2011, and a total of four episodes were originally supposed to broadcast before the series was withdrawn. The fourth episode aired a day before Musso\'s mid-October 2011 arrest on a charge of driving while intoxicated (and subsequent removal from the cast of "Pair of Kings"), and the remaining two episodes premiered solely in the United Kingdom and Latin America, they premiered in the U.S. in November 2016 on Disney XD.', 'title': 'PrankStars'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Gulder Ultimate Search (also called GUS) is a Nigerian reality television series, created and sponsored by Nigerian Breweries Plc to promote the Gulder Lager Beer. The first season premiered in 2004. The GUS series is also the very first 100% local content reality television programme in Nigeria and it is a survival type reality programme that highlights the struggle of Contestants (10–30 persons, depending on the reference edition), their struggles against themselves and the wild i.e. nature and their search for a hidden treasure that brings to the last person standing instant fame and fortune. The Winner of the last season in 2012 took home a 10 million naira cash prize and an SUV.', 'title': 'Gulder Ultimate Search'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Kendra on Top is an American reality television series on WE tv that debuted June 5, 2012. The series follows the day-to-day life of former "Playboy" model and "The Girls Next Door" reality television personality Kendra Baskett as she balances motherhood and her business ventures. Season 2 chronicles Wilkinson as she prepares and participates as a celebrity contestant on "Splash" and stars on "Celebrity Wife Swap". The series also documents the activities of her husband, Hank Baskett, as he works on his transition from NFL football player to businessman. Kendra\'s car accident that occurred in April 2013 is also included. WE tv renewed "Kendra on Top" for a fourth season which premiered on August 21, 2015. WE tv renewed "Kendra on Top" for a fifth season which premiered on April 1, 2016.', 'title': 'Kendra on Top'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Kenneth Edgar "Kenny" Wormald (born July 27, 1984) is an American dancer, reality television star and actor. His best known role to date is perhaps as Ren McCormack in the 2011 remake of 1984\'s "Footloose". Wormald was a regular on the MTV reality television series "Dancelife" in 2007.', 'title': 'Kenny Wormald'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Ice Road Truckers (commercially abbreviated IRT) is a reality television series that premiered on History, on June 17, 2007. It features the activities of drivers who operate trucks on seasonal routes crossing frozen lakes and rivers, in remote Arctic territories in Canada and Alaska. Later series focused on Alaska's improved but still remote Dalton Highway, which is mainly snow-covered solid ground. The newest seasons are based on Manitoba's winter roads.", 'title': 'Ice Road Truckers'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'De Afvallers (literal translation: "The Slimmers") is a Dutch reality television series which first premiered on SBS 6. The series is a spin-off of the American reality television series "The Biggest Loser" and the SBS 6 weight-loss series "", which was canceled after two seasons due to low ratings.', 'title': 'The Biggest Loser (Dutch TV series)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Total Drama Presents: The Ridonculous Race (also known as "Total Drama: Ridonculous Race", or simply "The Ridonculous Race") is a Canadian animated reality television series which lampoons the conventions commonly found in reality television. The show is a spin-off of the original "Total Drama" series created in 2007 and the second series created as part of the overall franchise. The series is created by Fresh TV Inc. and distributed by Cake Entertainment and airs on Cartoon Network in North America. The series premiered in the United States on September 7, 2015, and then began airing in Canada on January 4, 2016. It also aired on ABC3 in Australia, starting December 12, 2015. Like the original series, this series consists of 26 episodes per season.', 'title': 'Total Drama Presents: The Ridonculous Race'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Fashion Show: Ultimate Collection (originally styled as The Fashion Show) is an American reality television series which premiered on May 7, 2009, on the Bravo cable network. The show focuses on fashion design and featured hosts fashion designer Isaac Mizrahi and supermodel Iman. The contestants competed against each other to create the best clothes and were restricted in time, materials, and theme, with the resulting designs judged and one or more designers eliminated each week. The show was originally co-hosted by singer Kelly Rowland, however, she was replaced by Iman in Season 2.', 'title': 'The Fashion Show (U.S. TV series)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The AACTA Award for Best Reality Television Series is an award presented by the Australian Academy of Cinema and Television Arts (AACTA), a non-profit organisation whose aim is to "identify, award, promote and celebrate Australia\'s greatest achievements in film and television." The award is presented at the annual AACTA Awards, which hand out accolades for achievements in feature film, television, documentaries and short films. The award was first introduced in 2012, for the 2nd AACTA Awards in 2013, due to the growth of reality television productions in Australia. Reality television productions could previously be submitted in the Best Light Entertainment Series category.', 'title': 'AACTA Award for Best Reality Television Series'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Lake Siegel Bell (born March 24, 1979) is an American actress, director, and screenwriter. She has starred in various television series, including "Boston Legal" (2004–2006), "Surface" (2005–2006), "How to Make It in America" (2010–2011) and "Childrens Hospital" (2008–2016), and in films including "Over Her Dead Body" (2008), "What Happens in Vegas" (2008), "It\'s Complicated" (2009), "No Strings Attached" (2011), "Million Dollar Arm" (2014) and "The Secret Life of Pets" (2016).', 'title': 'Lake Bell'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "I Do...Until I Don't is a 2017 American comedy film written and directed by Lake Bell. The film stars Lake Bell, Ed Helms, Mary Steenburgen, Paul Reiser, Amber Heard, Dolly Wells, and Wyatt Cenac. The film was released on September 1, 2017, by The Film Arcade.", 'title': "I Do...Until I Don't"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "It's Complicated is a 2009 American romantic comedy film written and directed by Nancy Meyers. It stars Meryl Streep as a successful bakery owner and single mother of three who starts a secret affair with her former husband, played by Alec Baldwin, ten years after their divorce\xa0– only to find herself drawn to another man: her architect Adam (portrayed by Steve Martin). The film also features supporting performances by Lake Bell, Hunter Parrish, Zoe Kazan, John Krasinski, Mary Kay Place, Robert Curtis Brown and Rita Wilson, among others.", 'title': "It's Complicated (film)"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Wainy Days is an internet video series starring David Wain that is hosted on the website, My Damn Channel. The web series follows a fictionalized version of Wain through his everyday life as he tries to form relationships with numerous women and discusses his problems with his friends at the sweatshop where he works. Elizabeth Banks, Jonah Hill, Julie Bowen, Megan Mullally, Jason Sudeikis, Rob Corddry, Lake Bell, Amanda Peet, Rosemarie DeWitt, Elizabeth Reaser, Thomas Lennon, Joe Lo Truglio, Josh Charles, Lucy Punch, A.D. Miles, Paul Rudd, Michael Ian Black, Rashida Jones, Michael Showalter and various other "Stella/The State/Wet Hot American Summer" alum have all guest-starred in various episodes. A DVD containing the first four seasons was released February 14, 2012. In 2013, Blip Partnered with My Damn Channel, leading to season 5 of "Wainy Days" being premiered simultaneously on Blip and MyDamnChannel.', 'title': 'Wainy Days'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Man Up is a 2015 British-French romantic comedy film directed by Ben Palmer from a screenplay written by Tess Morris, starring Simon Pegg and Lake Bell. The film follows a single 34-year-old woman (Bell), who after being mistaken for a stranger's blind date, finds the perfect boyfriend in a 40-year-old divorcé (Pegg). The film was released on 29 May 2015 by StudioCanal.", 'title': 'Man Up (film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Over Her Dead Body is a 2008 American romantic comedy film starring Eva Longoria, Paul Rudd, Lake Bell, Lindsay Sloane and Jason Biggs. It was written and directed by Jeff Lowell. The film is about Kate (Eva Longoria), who dies on the day of her wedding to fiancé Henry (Paul Rudd). He subsequently begins a relationship with psychic Ashley (Lake Bell) who becomes haunted by Kate trying to sabotage their relationship.', 'title': 'Over Her Dead Body'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'In a World... is a 2013 American comedy film written, directed and co-produced by Lake Bell.', 'title': 'In a World...'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "A Good Old Fashioned Orgy is a 2011 comedy film written and directed by Alex Gregory and Peter Huyck. It stars Jason Sudeikis, Leslie Bibb, Lake Bell, Michelle Borth, Nick Kroll, Tyler Labine, Angela Sarafyan, Lindsay Sloane, Martin Starr, Lucy Punch and Will Forte. The main plot follows Eric, who, having thrown parties at his father's house for years, decides to have one last party when the house is to be sold: an orgy.", 'title': 'A Good Old Fashioned Orgy'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'What Happens in Vegas is a 2008 American comedy film directed by Tom Vaughan, written by Dana Fox and starring Cameron Diaz and Ashton Kutcher. The title is based on the Las Vegas marketing catchphrase "What happens in Vegas, stays in Vegas."', 'title': 'What Happens in Vegas'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Secret Life of Pets is a 2016 American computer-animated comedy film produced by Illumination Entertainment. It is directed by Chris Renaud, and co-directed by Yarrow Cheney, and written by Brian Lynch, Cinco Paul and Ken Daurio. The film stars Louis C.K., Eric Stonestreet, Kevin Hart, Steve Coogan, Ellie Kemper, Bobby Moynihan, Lake Bell, Dana Carvey, Hannibal Buress, Jenny Slate and Albert Brooks.', 'title': 'The Secret Life of Pets'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Adventist World is a monthly international magazine of the Seventh-day Adventist Church published by the Review and Herald Publishing Association. Editors are based in Silver Spring, Maryland and Seoul, Korea.', 'title': 'Adventist World'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Pratyoush Onta is a Nepali historian and editor based at Martin Chautari. He is the author and/or editor of 22 books including "Social History of Radio Nepal" (2004, in Nepali), "Growing up with Radio" (2005, in Nepali), "25 Years of Nepali Magazines" (2013, in Nepali), "The State of History Education and Research in Nepal" (2014) and "Political Change and Public Culture in Post-1990 Nepal" (2017). He received his BA (economics) in 1988 from Brandeis University and PhD in history from the University of Pennsylvania in 1996. He has written about the media in Nepal in the past and now mostly writes about higher education, research and knowledge distribution. He is a former Chair and current Director of Research, Martin Chautari, Kathmandu, Nepal. He is also the founding editor of the journals "Studies in Nepali History and Society" (SINHAS) published since 1996 by Mandala Book Point, Kathmandu and "Media Adhyayan" (established 2006), which he co-edited for 10 years (2006-2015). He continues to edit SINHAS.', 'title': 'Pratyoush Onta'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Seventh-day Adventist educational system is part of the Seventh-day Adventist Church and overseen by the General Conference of Seventh-day Adventist located in Silver Spring, Maryland.The educational system is the second-largest Christian school-system in the world, after the Roman Catholic system.', 'title': 'Seventh-day Adventist education'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Billy Kahora is a Kenyan writer and editor based in Nairobi. He was commended by the 2007 Caine Prize judges for his story "Treadmill Love". His stories "Urban Zoning" and "Gorilla’s Apprentice" were shortlisted for the prize in 2012 and 2014, respectively. He has written the non-fiction novella "The True Story of David Munyakei" the screenplay for "Soul Boy" and co-wrote "Nairobi Half Life". As Managing Editor of Kwani Trust, Kahora has edited seven issues of the "Kwani? " journal. He is a contributing editor to the "Chimurenga Chronic".', 'title': 'Billy Kahora'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': "Girls' Life is an American teen magazine. It was launched in 1994 by Monarch Services. The magazine is headquartered in Baltimore, Maryland.", 'title': "Girls' Life (magazine)"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "The BBC Somali Service is a BBC World Service radio station transmitted in the Somali language and based in Broadcasting House in West London. From 1999 until 2012, the head of the station was Yusuf Garaad Omar, a Somali journalist, who joined in 1992. Most of the listeners live in the Horn of Africa and nearby regions. According to the station, it provides a key link between those in Somalia and those elsewhere. Established on 18 July 1957 with two weekly programmes of 15 minutes each, the station made the broadcasts daily by September 1958, and on 1 July 1961 the two parts were joined and the programme time increased to 30 minutes. Increases in broadcast frequency have been made since. They currently broadcast 3 half-hour programmes and one 1-hour programme daily. The station has been developing local networks in all over Somali speaking areas in Somalia, Djibouti, the Somali region of Ethiopia and North Eastern Kenya plus the Somali diaspora all over the world. In August 2010 AllAfrica.com reported that Shabelle Media Network had started broadcasting some of the station's programmes. Since Yusuf Garad left the BBC, the Somali service never returned to the management of a Somali professional instead, at least three managers replaced after the other. First, Andres Ilves had been placed as acting head of the service for nearly two years, Josephine Hazeley deputy head of BBC Africa had been put as a caretaker. A recruitment process that followed for a BBC Somali Editor, Abdirahman Koronto , has been the successful candidate but was offered a BBC Somali Output Editor role to be line managed by the then Editor of BBC Afrique, Ibrahima Daine, as the acting editor of BBC Somali. A new role had been advertised as the editor BBC Swahili/Somali editor based in Nariobi, Caroline Karobia has been appointed to this role.", 'title': 'BBC Somali Service'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Ángel Manuel Rodríguez (1945—) is a Seventh-day Adventist theologian and was the director of the Biblical Research Institute (BRI) before his retirement. His special research interests include Old Testament, Sanctuary and Atonement, and Old Testament Theology. He has written several books, and authors a monthly column in "Adventist World".', 'title': 'Ángel Manuel Rodríguez'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Jason Sizemore is an American writer and editor based in Lexington, Kentucky. He is the owner and managing editor of Apex Publications. He was born in Big Creek, KY (pop. 400). He was the editor and publisher of "Apex Digest", a quarterly science fiction and horror digest that ran for 12 issues between 2005 and 2008. As the publisher/managing editor of "Apex Magazine", he was nominated for the Hugo Award in the semiprozine category in 2012, 2013 and 2014. As a writer he has published several stories in genre magazines. His first short story collection, "Irredeemable", was published in April, 2014.', 'title': 'Jason Sizemore'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Adventist Review is the official newsmagazine of the Seventh-day Adventist Church. Commonly known as the Review, it is published weekly by the Review and Herald Publishing Association. The Review and Herald also publishes a sister magazine, "Adventist World". The magazine is headquartered in Silver Spring, Maryland. The current editor of the "Adventist Review" is Bill Knott. The magazine currently has nearly 30,000 paying subscribers. Its library reference number is OCLC\xa09572173  .', 'title': 'Adventist Review'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Adventist HealthCare is a not-for-profit health services organization based in Gaithersburg, Maryland that employs more than 6,200 people and provides healthcare for more than 400,000 individuals in the community each year. The primary service area for Adventist HealthCare is the Washington, D.C. metropolitan area. Despite similar names, it is not a part of the California-based Adventist Health, or the Florida-based Adventist Health System.', 'title': 'Adventist HealthCare'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Oswalt Kolle (2 October 1928, Kiel – 24 September 2010, Amsterdam) was a German sex educator, who became famous during the late 1960s and early 1970s for his numerous pioneering books and films on human sexuality. His work was translated into all major languages, while his films found an audience of 140 million worldwide. In his 1997 book "Open to Both Sides" he came out as bisexual. He was awarded the Magnus Hirschfeld Medal in 2000.', 'title': 'Oswalt Kolle'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Among the first published works of Tongan literature, in the late 1960s and early 1970s, were \'Epeli Hau\'ofa\'s short stories and Konai Helu Thaman\'s poetry. Hau\'ofa\'s popular collection of short stories "Tales of the Tikongs" (1973) was followed by a novel, "Kisses in the Nederends", 1987, noted for its satirical style. The emergence of Tongan written literature (as distinct from oral literature) took place in the context of the development of indigenous Pacific Islander literature in the Pacific region as a whole, beginning in the late 1960s.', 'title': 'Tongan literature'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "This is an incomplete list of heavy metal festivals. Heavy metal (or simply metal) is a genre of rock music that developed in the late 1960s and early 1970s, largely in the United States and the United Kingdom. With roots in blues rock and psychedelic rock, the first heavy metal bands such as Led Zeppelin, Black Sabbath and Deep Purple attracted large audiences, and during the late 1960s and mid-1970s these band and others in their genre were featured at a number of historic rock festivals. Judas Priest helped spur the genre's evolution by discarding much of its blues influence.", 'title': 'List of heavy metal festivals'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Inner Secrets is the ninth studio album by Santana. It was released in 1978 and marks the start of the phase of Santana\'s career where he moved away from the fusion of Latin, jazz, rock and blues that marked his previous records and began to move towards an album-oriented rock direction. As such, the album\'s quality is widely disputed among fans. " Stormy" and "One Chain (Don\'t Make No Prison)" were both hit singles. In The Netherlands "Well All Right" was released as a single and reached #22 in the top 40.', 'title': 'Inner Secrets'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'John Cooper Clarke (born 25 January 1949) is an English performance poet who first became famous during the punk rock era of the late 1970s when he became known as a "punk poet". He released several albums in the late 1970s and early 1980s, and continues to perform regularly.', 'title': 'John Cooper Clarke'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Synth-pop (short for synthesizer pop; also called techno-pop) is a subgenre of new wave music that first became prominent in the late 1970s, reached its heyday in the 1980s, and features the synthesizer as the dominant musical instrument. It was prefigured in the 1960s and early 1970s by the use of synthesizers in progressive rock, electronic, art rock, disco, and particularly the "Krautrock" of bands like Kraftwerk. It arose as a distinct genre in Japan and the United Kingdom in the post-punk era as part of the new wave movement of the late 1970s to the mid-1980s.', 'title': 'Synth-pop'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Richard Estes (born May 14, 1932 in Kewanee, Illinois) is an American artist, best known for his photorealist paintings. The paintings generally consist of reflective, clean, and inanimate city and geometric landscapes. He is regarded as one of the founders of the international photo-realist movement of the late 1960s, with such painters as John Baeder, Ralph Goings, Chuck Close, Audrey Flack, and Duane Hanson. Author Graham Thompson writes "One demonstration of the way photography became assimilated into the art world is the success of photorealist painting in the late 1960s and early 1970s. It is also called super-realism or hyper-realism and painters like Richard Estes, Denis Peterson, Audrey Flack, and Chuck Close often worked from photographic stills to create paintings that appeared to be photographs."', 'title': 'Richard Estes'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Carlos Santana \xa0\xa0 (born July 20, 1947) is a Mexican and American musician who first became famous in the late 1960s and early 1970s with his band, Santana, which pioneered a fusion of rock and Latin American music. The band\'s sound featured his melodic, blues-based guitar lines set against Latin and African rhythms featuring percussion instruments such as timbales and congas not generally heard in rock music. Santana continued to work in these forms over the following decades. He experienced a resurgence of popularity and critical acclaim in the late 1990s. In 2003 "Rolling Stone" magazine listed Santana at number 20 on their list of the 100 Greatest Guitarists of All Time. He has won 10 Grammy Awards and three Latin Grammy Awards.', 'title': 'Carlos Santana'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Progressive country is a subgenre of country music developed in the early 1970s. In the late 1960s and early 1970s, mainstream country music was dominated by the slick Nashville sound and the rock-influenced Bakersfield sound of artists like Merle Haggard. A new generation of country artists emerged, influenced by contemporary rock music, singer-songwriters such as Bob Dylan, and the liberal politics of the 1960s counterculture.', 'title': 'Progressive country'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Jazz fusion (also known as fusion) is a musical genre that developed in the late 1960s when musicians combined aspects of jazz harmony and improvisation with styles such as funk, rock, rhythm and blues, and Latin jazz. During this time many jazz musicians began experimenting with electric instruments and amplified sound for the first time, as well as electronic effects and synthesizers. Many of the developments during the late 1960s and early 1970s have since become established elements of jazz fusion musical practice.', 'title': 'Jazz fusion'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Imperial House of Japan (皇室 , kōshitsu ) , also referred to as the Imperial Family, and the Yamato dynasty, comprises those members of the extended family of the reigning Emperor of Japan who undertake official and public duties. Under the present Constitution of Japan, the Emperor is "the symbol of the State and of the unity of the people". Other members of the imperial family perform ceremonial and social duties, but have no role in the affairs of government. The duties as an Emperor are passed down the line to their children and so on.', 'title': 'Imperial House of Japan'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The Emperor of Japan is the head of the Imperial Family and the traditional head of state of Japan. According to the 1947 constitution, he is "the symbol of the State and of the unity of the people." Historically, he is also the highest authority of the Shinto religion as he and his family are said to be the direct descendants of the sun-goddess Amaterasu, and his importance also lies in dealing with heavenly affairs, including Shinto ritual and rites throughout the nation.', 'title': 'Emperor of Japan'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Kyu-Miyake (旧宮家 , literally former Miyake ) , also known as the Old Imperial Family (旧皇族), were branches of the Japanese Imperial Family created from branches of the Fushimi-no-miya house. All but one of the "ōke" were formed by the descendants of Prince Fushimi Kuniye. The ōke were stripped of their membership in the Imperial Family by the American Occupation Authorities in October 1947, as part of the abolition of collateral imperial houses. After that point, only the immediate family of Hirohito and those of his three brothers retained membership in the Imperial Family. However, unofficial heads of these collateral families still exist for most and are listed herein.', 'title': 'Ōke'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The Kyūjō incident (宮城事件 , Kyūjō Jiken ) was an attempted military coup d'état in Japan at the end of the Second World War. It happened on the night of 14–15 August 1945, just before the announcement of Japan's surrender to the Allies. The coup was attempted by the Staff Office of the Ministry of War of Japan and many from the Imperial Guard of Japan to stop the move to surrender.", 'title': 'Kyūjō incident'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Lt. Col. Masahiko Takeshita (竹下正彦 , Takeshita Masahiko ) was the head of the domestic affairs section of the Military Affairs Bureau of the Imperial Japanese Army during World War II. In August 1945, he helped plan a "coup" along with Major Kenji Hatanaka and a handful of others , with the intent of preventing the Emperor\'s announcement of Japan\'s surrender from being broadcast.', 'title': 'Masahiko Takeshita'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'General Prince Naruhiko Higashikuni (東久邇宮稔彦王 , Higashikuni-no-miya Naruhiko Ō , 3 December 1887 – 20 January 1990) was a Japanese imperial prince, a career officer in the Imperial Japanese Army and the 30th Prime Minister of Japan from 17 August 1945 to 9 October 1945, a period of 54 days. An uncle-in-law of Emperor Hirohito twice over, Prince Higashikuni was the only member of the Japanese imperial family to head a cabinet and was the last general officer of the Imperial Japanese military to become Prime Minister. He was the founder of the Chiba Institute of Technology.', 'title': 'Prince Naruhiko Higashikuni'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Prince Nashimoto Morimasa (梨本宮守正王 , Nashimoto no miya Morimasa ō , 9 March 1874 – 2 January 1951) was a member of the Japanese Imperial Family and a "Gensui" (Marshal-General) in the Imperial Japanese Army. An uncle-in-law of Emperor Shōwa, an uncle of his consort, Empress Kōjun, and the father-in-law of Crown Prince Euimin of Korea, Prince Nashimoto was the only member of the Imperial Family arrested for war crimes during the American occupation of Japan following the Second World War.', 'title': 'Prince Nashimoto Morimasa'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The surrender of Imperial Japan was announced on August 15 and formally signed on September 2, 1945, bringing the hostilities of World War II to a close. By the end of July 1945, the Imperial Japanese Navy (IJN) was incapable of conducting major operations and an Allied invasion of Japan was imminent. Together with the British Empire and China, the United States called for the unconditional surrender of the Japanese armed forces in the Potsdam Declaration on July 26, 1945—the alternative being "prompt and utter destruction". While publicly stating their intent to fight on to the bitter end, Japan\'s leaders (the Supreme Council for the Direction of the War, also known as the "Big Six") were privately making entreaties to the still-neutral Soviet Union to mediate peace on terms more favorable to the Japanese. Meanwhile, the Soviets were preparing to attack Japanese forces in Manchuria and Korea (in addition to South Sakhalin and the Kuril Islands) in fulfillment of promises they had secretly made to the United States and the United Kingdom at the Tehran and Yalta Conferences.', 'title': 'Surrender of Japan'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Victory over Japan Day (also known as V-J Day, Victory in the Pacific Day, or V-P Day) is the day on which Imperial Japan surrendered in World War II, in effect ending the war. The term has been applied to both of the days on which the initial announcement of Japan's surrender was made – to the afternoon of August 15, 1945, in Japan, and, because of time zone differences, to August 14, 1945 (when it was announced in the United States and the rest of the Americas and Eastern Pacific Islands) – as well as to September 2, 1945, when the signing of the surrender document occurred, officially ending World War II.", 'title': 'Victory over Japan Day'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Imperial House of France during the First French Empire consisted of the family members of Napoleon, including the House of Bonaparte, who held imperial titles as Emperor, Empress, Imperial Prince or French Prince, and who were in the order of succession to the French imperial throne in accordance with the French constitution of 1804. According to Title III, Article 9 ("The Imperial Family"), "the members of the imperial family in the order of succession, bear the title of Princes of France ("princes français")" and "the eldest son of the Emperor bears the title Prince Imperial ("prince impérial")."', 'title': 'Imperial House of France (First French Empire)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Jane Goodall Institute (Hong Kong) (), founded in 2002, was established as a local registered charity involved in the promotion of the well-being of the community, animals and environment. The Jane Goodall Institute Hong Kong is one of the Asian branches of the Jane Goodall Institute which was founded in 1977 in California by Jane Goodall and Genevieve, Princess di San Faustino. With its headquarters in the US, the Jane Goodall Institute is a worldwide non-profit organization with 17 overseas offices.', 'title': 'Jane Goodall Institute (Hong Kong)'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Birutė Marija Filomena Galdikas, OC (born 10 May 1946), is a Lithuanian-Canadian anthropologist, primatologist, conservationist, ethologist, and author. She is currently a Professor at Simon Fraser University. Well known in the field of primatology, Galdikas is recognized as a leading authority on orangutans. Prior to her field study of orangutans, scientists knew little about the species.', 'title': 'Birutė Galdikas'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Dawn Prince-Hughes (born January 31, 1964 in Carbondale, Illinois) is an American anthropologist, primatologist, and ethologist who received her M.A. and PhD in interdisciplinary anthropology from the Universität Herisau in Switzerland. In 2000 she was appointed an adjunct professor at Western Washington University. She is the executive chair of ApeNet Inc., has served as the executive director of the Institute for Cognitive Archaeological Research and is associated with the Jane Goodall Institute.', 'title': 'Dawn Prince-Hughes'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Woman in the Mists: The Story of Dian Fossey and the Mountain Gorillas of Africa is a 1987 biography of the conservationist Dian Fossey, who studied and lived among the mountain gorillas of Rwanda.', 'title': 'Woman in the Mists'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Richard Erskine Frere Leakey FRS (born 19 December 1944) is a Kenyan paleoanthropologist, conservationist, and politician. He is second of the three sons of the archaeologists Louis Leakey and Mary Leakey.', 'title': 'Richard Leakey'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "The Trimates, sometimes called Leakey's Angels, is a name given to three women — Jane Goodall, Dian Fossey, and Birutė Galdikas — chosen by anthropologist Louis Leakey to study hominids in their natural environments. They studied chimpanzees, gorillas and orangutans respectively.", 'title': 'The Trimates'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Dame Jane Morris Goodall {\'1\': ", \'2\': ", \'3\': ", \'4\': "} ( ; born Valerie Jane Morris-Goodall, 3 April 1934), formerly Baroness Jane van Lawick-Goodall, is a British primatologist, ethologist, anthropologist, and UN Messenger of Peace. Considered to be the world\'s foremost expert on chimpanzees, Goodall is best known for her over 55-year study of social and family interactions of wild chimpanzees since she first went to Gombe Stream National Park, Tanzania in 1960. She is the founder of the Jane Goodall Institute and the Roots & Shoots programme, and she has worked extensively on conservation and animal welfare issues. She has served on the board of the Nonhuman Rights Project since its founding in 1996.', 'title': 'Jane Goodall'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Dian Fossey ( ; January 16, 1932 – c. December 26, 1985) was an American primatologist and conservationist known for undertaking an extensive study of mountain gorilla groups over a period of 18 years. She studied them daily in the mountain forests of Rwanda, initially encouraged to work there by anthropologist Louis Leakey. Her 1983 book, "Gorillas in the Mist", combines her scientific study of the gorillas at Karisoke Research Center with her own personal story. It was adapted into a 1988 film of the same name. Fossey was brutally murdered in her cabin at a remote camp in Rwanda in December 1985.', 'title': 'Dian Fossey'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Dian Fossey Gorilla Fund International (originally the Digit Fund) is a charity for the protection of endangered mountain gorillas. The Digit Fund was created by Dr. Dian Fossey in 1978 for the sole purpose of financing her anti-poaching patrols and preventing further poaching of the mountain gorillas. Fossey studied at her Karisoke Research Center in the Virunga Volcanoes of Rwanda. The non-profit fund was named in memory of Fossey's favourite gorilla, Digit, who was decapitated by poachers for the offer of US$20 by a Hutu merchant who specialized in selling gorilla heads as trophies and gorilla hands as ashtrays to tourists.", 'title': 'Digit Fund'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Mountain Gorilla is a 2010 three-part television series produced by the BBC Natural History Unit which features intimate footage of the last remaining wild population of the eponymous great ape. The BBC film-makers were granted access to habituated groups of mountain gorillas in their highland stronghold: Rwanda's Virunga National Park and Uganda's Bwindi Impenetrable Forest. The cameras follow field scientists, veterinary teams and anti-poaching patrols for six months as they watch over the gorillas, providing medical care, protection and observations on their daily lives. The study of these apes was initiated by the primatologist Dian Fossey in the late 1960s.", 'title': 'Mountain Gorilla (TV series)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "The Government Digital Service is a unit of the Her Majesty's Government's Cabinet Office tasked with transforming the provision of government digital services. It was formed in April 2011 to implement the 'Digital by Default' strategy proposed by a report produced for the Cabinet Office in 2010 called 'Directgov 2010 and beyond: revolution not evolution'. It is overseen by the Public Expenditure Executive (Efficiency & Reform) which is co-chaired by Minister for the Cabinet Office, Ben Gummer and the Chief Secretary to the Treasury, David Gauke. GDS is primarily based in the Whitechapel Building, London. Its Director General is Kevin Cunnington.", 'title': 'Government Digital Service'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Nalini Netto is a retired officer in the Indian Administrative Service and now she has been assigned as the Principal Secretary to the Chief Minister of Kerala. She was appointed as State Chief Secretary took the office on April 1, 2017, from incumbent S. M. Vijayanand, who vacated on March 31 on superannuation. She is the 42nd head and 4th women head of the state bureaucracy. Her cousin Girija Vaidyanathan is the current Chief Secretary of Tamilnadu and both Nalini, Girija and Vijanand were 1981 batch IAS officers. Before becoming the chief secretary she had been in the post of Chief electoral officer and home secretary. Nalini Netto was in news when she filed a case against the Transport minister Neelalohithadasan Nadar in 2000 when she was the Transport Secretary. Before this incident he was penalized for a similar case filed in by forsest office Prakriti Srivastava.', 'title': 'Nalini Netto'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Chief Secretary for Administration (), commonly known as the Chief Secretary of Hong Kong, is the most senior principal official of the Government of the Hong Kong Special Administrative Region. The Chief Secretary is the head of the Government Secretariat which oversees the administration of the Region to which all other ministers belong, and is accountable for his or her policies and actions to the Chief Executive and to the Legislative Council. Under Article 53 of the Basic Law, Hong Kong\'s mini-constitution, the position is known as "Administrative Secretary".', 'title': 'Chief Secretary for Administration'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Exchequer Secretary to the Treasury is a junior ministerial post in the British Treasury, ranked below the Chancellor of the Exchequer, the Chief Secretary to the Treasury, the Paymaster General and the Financial Secretary to the Treasury, and alongside the Economic Secretary to the Treasury. It ranks at Parliamentary Secretary level and is not a Cabinet office. Unlike the other posts of Secretary to the Treasury, it is only used occasionally, normally when the post of Paymaster General is allocated to a Minister outside the Treasury.', 'title': 'Exchequer Secretary to the Treasury'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'David Michael Gauke ( ; born 8 October 1971) is a British Conservative Party politician and a solicitor. He has been the MP for South West Hertfordshire since 2005 and is the current Secretary of State for Work and Pensions.', 'title': 'David Gauke'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Shadow Chief Secretary to the Treasury is a member of the Shadow Cabinet, and is the deputy to the Shadow Chancellor. The Shadow Chief Secretary to the Treasury acts as the primary opposition to the equivalent Governmental position, the Chief Secretary to the Treasury, who is deputy to the Chancellor of the Exchequer. Currently the position of Shadow Chief Secretary to the Treasury is held by Peter Dowd of the Labour Party.', 'title': 'Shadow Chief Secretary to the Treasury'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Dato Seri Paduka Sir Denys Tudor Emil Roberts, KBE, SPMB, QC (Traditional Chinese: 羅弼時爵士, 19 January 1921 – 20 May 2013) was a British colonial official and judge. Joining the colonial civil service as a Crown Counsel in Nyasaland (now Malawi) in 1953, he became Attorney General of Gibraltar in 1960. In 1962, he was posted to Hong Kong as Solicitor-General, and was successively promoted to Attorney-General in 1966, Colonial Secretary/Chief Secretary in 1973 and Chief Justice in 1979. He was the first and only Attorney-General to become both Colonial Secretary (and Chief Secretary) in Hong Kong. Never having been a judge before, he was appointed as Chief Justice of the Supreme Court in 1979 and was the first and only Colonial Secretary (and Chief Secretary) of Hong Kong to receive such appointment.', 'title': 'Denys Roberts'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Chief Secretary for Ireland was a key political office in the British administration in Ireland. Nominally subordinate to the Lord Lieutenant, and officially the "Chief Secretary to the Lord Lieutenant", from the early 19th century until the end of British rule he was effectively the government minister with responsibility for governing Ireland; usually it was the Chief Secretary, rather than the Lord Lieutenant, who sat in the British Cabinet. The Chief Secretary was "ex officio" President of the Local Government Board for Ireland from its creation in 1872.', 'title': 'Chief Secretary for Ireland'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "In the United Kingdom, there are several Secretaries to the Treasury, who are Treasury ministers nominally acting as secretaries to HM Treasury. The origins of the office are unclear, although it probably originated during Lord Burghley's tenure as Lord Treasurer in the 16th century. The number of secretaries was expanded to two by 1714 at the latest. The Treasury ministers together discharge all the former functions of the Lord Treasurer, which are nowadays nominally vested in the Lords Commissioners of the Treasury. Of the Commissioners, only the Second Lord of the Treasury, who is also the Chancellor of the Exchequer, is a Treasury minister (the others are the Prime Minister and the Government Whips). The Chancellor is the senior Treasury minister, followed by the Chief Secretary to the Treasury, who also attends Cabinet and has particular responsibilities for public expenditure. In order of seniority, the junior Treasury ministers are: the Financial Secretary to the Treasury; the Economic Secretary to the Treasury; the Exchequer Secretary to the Treasury; and the Commercial Secretary to the Treasury (Office currently not in use). One of the present-day secretaries, the Parliamentary Secretary to the Treasury, formerly known as the 'Patronage Secretary', is not a Treasury minister but the Government Chief Whip in the House of Commons. The office can be seen as a sinecure, allowing the Chief Whip to draw a government salary, attend Cabinet, and use a Downing Street residence.", 'title': 'Secretary to the Treasury'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'GOV.UK Verify is an identity assurance system developed by the UK Government Digital Service (GDS). The system is intended to provide a single trusted login across all UK government digital services, verifying the user’s identity in 15 minutes. It allows users to choose one of several companies to verify their identity to a standard level of assurance before accessing 12 central government online services.', 'title': 'GOV.UK Verify'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Rock \'n\' Roll Star" is a song by English rock band Oasis. It is the opening track from their record breaking debut album, "Definitely Maybe". Like the majority of the band\'s songs from this era, it was written by lead guitarist Noel Gallagher. Noel said that "Rock \'n\' Roll Star" was one of only three songs in which he wanted to say something: "I\'ve pretty much summed up everything I wanted to say in "Rock \'n\' Roll Star", "Live Forever" and "Cigarettes & Alcohol", after that I\'m repeating myself, but in a different way". It became a fan favourite and was often played to close the band\'s gigs.', 'title': "Rock 'n' Roll Star"}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Almost Sunrise is a 2016 American documentary film directed by Michael Collins. It recounts the story of two Iraq veterans, Tom Voss and Anthony Anderson, who, in an attempt to put their combat experience behind them, embark on a 2,700-mile trek on foot across America. It made its world premiere on the opening night of the Telluride Mountainfilm Festival on 27 May, 2016.', 'title': 'Almost Sunrise'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'It\'s Only Rock \'n Roll is the 12th British and 14th American studio album by The Rolling Stones, released in 1974. It was the last Rolling Stones album for guitarist Mick Taylor and the songwriting and recording of the album\'s title track had a connection to Taylor\'s eventual replacement, Ronnie Wood. The album also marked the 10th anniversary since the release of the band\'s debut album, "The Rolling Stones". "It\'s Only Rock \'n Roll" has a firmer rock sound than the band\'s previous album, the more funk - and soul - inspired "Goats Head Soup". "It\'s Only Rock \'n Roll" reached #1 in the US and #2 in the UK.', 'title': "It's Only Rock 'n Roll"}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Just... Fabulous Rock \'n\' Roll is a studio album by Cliff Richard, released 11 November 2016. The album continues the rock \'n\' roll theme of his previous studio album "The Fabulous Rock \'n\' Roll Songbook". It comprises covers of 14 classic rock \'n\' roll songs and one new song "It\'s Better to Dream". It features Elvis Presley in duet with Richard in "Blue Suede Shoes" and Peter Frampton on guitar in "Dimples". The album reached number 4 on the UK Albums Chart and has been certified Gold for sales over 100,000 in the UK.', 'title': "Just... Fabulous Rock 'n' Roll"}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'World Rock \'n\' Roll Confederation (WRRC) was registered in 1984, although its history traces to 1974. It is an umbrella organization for national professional and amateur Rock and Roll dancesport federations. Its statute that it "aims at promoting the physical training of its members by means of sporting activities in the form of Rock \'n\' Roll dance tournaments, including the acrobatic variations (acrobatic rock \'n\' roll) as well as Rock \'n\' Roll and Boogie Woogie, Lindy Hop, Formation and alternative styles in line with the rules and sporting presentations". The registered office is in Ljubljana, Slovenia.', 'title': "World Rock'n'Roll Confederation"}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Rock \'n\' Roll is the sixth studio album by John Lennon. Released in 1975, it is an album of late 1950s and early 1960s songs as covered by Lennon. Recording the album was problematic and spanned an entire year: Phil Spector produced sessions in October 1973 at A&M Studios, and Lennon produced sessions in October 1974 at Record Plant Studios (East). Lennon was being sued by Morris Levy over copyright infringement of one line in his song "Come Together". As part of an agreement, Lennon had to include three Levy-owned songs on "Rock \'n\' Roll". Spector disappeared with the session recordings and was subsequently involved in a motor accident, leaving the album\'s tracks unrecoverable until the beginning of the "Walls and Bridges" sessions. With "Walls and Bridges" coming out first, featuring one Levy-owned song, Levy sued Lennon expecting to see Lennon\'s "Rock \'n\' Roll" album.', 'title': "Rock 'n' Roll (John Lennon album)"}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "Hail! Hail! Rock 'n' Roll is a 1987 documentary film directed by Taylor Hackford that chronicles two 1986 concerts celebrating rock and roll musician Chuck Berry's 60th birthday. A soundtrack album was released in October 1987 on the MCA label. The name comes from a line in the song School Days.", 'title': "Hail! Hail! Rock 'n' Roll"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Feelin\' Satisfied" is a 1978 song written by Tom Scholz for the Boston band album "Don\'t Look Back". Paul Grein of "Billboard" described the song as "an affectionate tribute to the power of music." The same magazine later described the song as an "upbeat track which is totally rock \'n\' roll," praising the "clear singing" and "fresh sounds." Terry Hazlett of The "Observer-Reporter" described the song as an "innocent little [ditty]" which comes across like a "rock \'n\' roll anthem." . AXS contributor Bill Craig describes the lyrics as being about "the wonders of rock music." Pete Bishop of "The Pittsburgh Press" claimed that it has "an infectious happy feel." "Ultimate Classic Rock" critic Michael Gallucci described it as a "simple" song that, in common with many Boston songs, "celebrates rock \'n\' roll." Gallucci rated it Boston\'s 8th greatest song, particularly praising the effect from the hand claps during the refrain. Paul Elliott rated it their 7th greatest song, commenting on its "sense of fun" as Scholz lets go of some of his usual control.', 'title': "Feelin' Satisfied"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"I Hate Rock \'n\' Roll" is a song by the Scottish alternative rock group The Jesus and Mary Chain. It was the first single from the band\'s compilation album, "Hate Rock \'n\' Roll". It was released together with 3 other tracks by Blanco y Negro Records in June 1995 and reached #61 in the UK single charts. This release was the last release for the band on this label. The 10" format was numbered and limited to 5000 copies. The reworked version of the track, which was dubbed as "I Love Rock \'n\' Roll" was also included on the group\'s last album "Munki", released in 1998.', 'title': "I Hate Rock 'n' Roll"}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Rock \'n\' Roll Circus is the eleventh studio album by Japanese recording artist Ayumi Hamasaki. It was released on April 14, 2010, by Avex Trax. It was also released just a little over a year after her 2009 album, "Next Level". "Rock \'n\' Roll Circus" marks Hamasaki\'s eleventh consecutive album to be fully produced by Japanese producer and manager Max Matsuura, while she contributes to the album as the lead vocalist, background vocalist, and songwriter to all songs. Recorded in Japanese with minor phrases in English, "Rock \'n\' Roll Circus" is a rock album with numerous musical elements such as electropop, J-pop, rock, pop ballad, and dance music.', 'title': "Rock 'n' Roll Circus"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Battle of Clitheroe was a battle between a force of Scots and English knights and men at arms which took place on 10 June 1138 during the period of The Anarchy. The battle was fought on the southern edge of the Bowland Fells, at Clitheroe, Lancashire. It took place in the course of an invasion of England by King David I of Scotland. In the summer of 1138, King David split his army into two forces. One of them, commanded by William fitz Duncan, Mormaer of Moray, marched into Lancashire. There he harried Furness and Craven. On 10 June, William fitz Duncan was met by a force of knights and men-at-arms. A pitched battle took place and the result was that the English army was routed. The battle was a prelude to the Battle of the Standard later in the summer, where the result was reversed.', 'title': 'Battle of Clitheroe'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Battle of Kuwait International Airport occurred on February 27, 1991 during the 1st Gulf War. It was a tank battle between the United States and Ba\'athist Iraq. Despite being a very large battle it is often overlooked compared to the other battles which took place during the war. No less than elements of 18 divisions total participated in this battle. U.S. Army Special Forces units and multiple Iraqi Commando units were also in theatre. In reality the battle took place over a span of three days despite the primary battle at Kuwait International Airport lasting only one day. Much of the combat actually took place en route to the airport. The battle featured the "Reveille Engagement" which went on to become the biggest and fastest tank battle in United States Marine Corps\' entire history.', 'title': 'Battle of Kuwait International Airport'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Battle of Tarawa was a battle in the Pacific Theater of World War II that was fought on 20–23 November 1943. It took place at the Tarawa Atoll in the Gilbert Islands, and was part of Operation Galvanic, the U.S. invasion of the Gilberts. Nearly 6,400 Japanese, Koreans, and Americans died in the fighting, mostly on and around the small island of Betio, in the extreme southwest of Tarawa Atoll.', 'title': 'Battle of Tarawa'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Battle of Wawon (Turkish: "Kunuri Muharebeleri" ), also known as the Battle of Wayuan (), was a series of delay actions of the Korean War that took place from November 27–29, 1950 near Wawon in present-day North Korea. After the collapse of the US Eighth Army\'s right flank during the Battle of the Ch\'ongch\'on River, the Chinese 38th Corps advanced rapidly towards the critical road junction at Kunu-ri in an effort to cut off United Nations forces\' retreat route. In what was considered to be Turkey\'s first real combat action since the aftermath of World War I, the Turkish Brigade attempted to delay the Chinese advances at Wawon. Although during the battle the Turkish Brigade was crippled after being encircled by Chinese forces with superior numbers, they were still be able to breach the Chinese trap and rejoin the US 2nd Infantry Division.', 'title': 'Battle of Wawon'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Battle of the Allia was fought between the Senones (one of the Gallic tribes which had invaded northern Italy) and the Romans. It was fought at the confluence of the rivers Tiber and Allia, eleven Roman miles (16\xa0km) north of Rome. The Romans were routed and subsequently the Senones sacked Rome. The common date given for the battle is 390 BC. This is based on the account of the battle by the Roman historian Livy and the Varronian Chronology, a Roman dating system. The ancient Greek historian Polybius, who used a Greek dating system, derived the date 387/6 BC. Plutarch wrote that the battle took place just after the summer solstice when the moon was near the full, a little more than three hundred and sixty years from the foundation of Rome. That would be shortly after 393 BC. Tacitus said that the battle took place the 15 before the Kalends of August, which is 18 July.', 'title': 'Battle of the Allia'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Battle of Berestechko (Polish: "Bitwa pod Beresteczkiem" ; Ukrainian: Берестецька битва, Битва під Берестечком ) was fought between the Ukrainian Cossacks, led by Hetman Bohdan Khmelnytsky, aided by their Crimean Tatar allies, and a Polish army under King John II Casimir. It was a battle of a Cossack rebellion in Ukraine that took place in the years 1648–1657 after the expiration of a two-year truce. Fought from 28 to 30 June 1651, the battle took place in the province of Volhynia, on the hilly plain south of the Styr River. The Polish camp was on the river opposite Berestechko and faced south, towards the Cossack army about two kilometers away, whose right flank was against the River Pliashivka (Pliashova) and the Tatar army on their left flank. It was probably the largest European land battle of the 17th century.', 'title': 'Battle of Berestechko'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The Battle of the Ch\'ongch\'on River, also known as the Battle of the Ch\'ongch\'on () or the Second Phase Campaign Western Sector (), was a decisive battle in the Korean War, and it took place from November 25 to December 2, 1950, along the Ch\'ongch\'on River Valley in the northwestern part of North Korea. In response to the successful Chinese First Phase Campaign against the United Nations forces, General Douglas MacArthur launched the Home-by-Christmas Offensive to evict the Chinese forces from Korea and to end the war. Anticipating this reaction, the Chinese People\'s Volunteer Army Commander Peng Dehuai planned a counteroffensive, dubbed the "Second Phase Campaign", against the advancing UN forces.', 'title': "Battle of the Ch'ongch'on River"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Battle of Dalrigh, also known as the Battle of Dail Righ, Battle of Dalry or Battle of Strathfillan, was fought in the summer of 1306 between the army of King Robert I of Scotland against the Clan MacDougall of Argyll who were allies of Clan Comyn and the English. It took place at the hamlet of Dalrigh (the "King\'s Field" in the Scottish Gaelic language) near Tyndrum in Perthshire, Scotland (not to be confused with Dalry, Ayrshire). Bruce\'s army, reeling westwards after defeat by the English at the Battle of Methven, was intercepted and all but destroyed, with Bruce himself narrowly escaping capture. The battle took place sometime between late July and early August, but the exact date is unknown.', 'title': 'Battle of Dalrigh'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Battle of Ticinus was a battle of the Second Punic War fought between the Carthaginian forces of Hannibal and the Romans under Publius Cornelius Scipio in November 218 BC. The battle took place in the flat country of Pavia county on the right bank of the Ticino River, not far north from its confluence (from the north) with the Po River. The battle is named from the river, not the nearby contemporaneous settlement of Ticinum (today's Pavia). Although the precise location is not known, it is generally accepted that a settlement known today as Vigevano is mentioned in Livy's text and that Scipio's camp was to the south at Gambolo, whose coordinates are given on the map. The conflict would have been west of there. It was the first battle of the war against the Romans that was fought on Italian soil and the first battle of the war to employ legion-sized forces. Its loss by the Romans, and the temporary disablement of Scipio's command, set the stage for the Roman disaster at the Battle of Trebbia in December.", 'title': 'Battle of Ticinus'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "The Third Battle of Seoul, also known as the Chinese New Year's Offensive, the January–Fourth Retreat (Korean: 1•4 후퇴 ) or the Third Phase Campaign Western Sector (), was a battle of the Korean War, which took place from December 31, 1950 to January 7, 1951 around the South Korean capital of Seoul. In the aftermath of the major Chinese victory at the Battle of the Ch'ongch'on River, the United Nations Command started to contemplate the possibility of evacuation from the Korean Peninsula. Upon learning of this development, China's Chairman Mao Zedong ordered the Chinese People's Volunteer Army to cross the 38th parallel in an effort to pressure the United Nations forces to withdraw from South Korea.", 'title': 'Third Battle of Seoul'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Jamil Fakhri (1946–2011) was a veteran Pakistani film, TV and stage artist. He gained high popularity from Pakistan Television Corporation's TV drama serial Andhera Ujala in (1984-1985) season by playing the character Jaffer Hussain (police inspector). In TV drama Andhera Ujala, a high-ranking police officer Qavi Khan and his team of low and middle rank members of police fight crime in their locality in very humorous situations.", 'title': 'Jamil Fakhri'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Hayley Catherine Rose Vivien Mills (born 18 April 1946) is an English actress. The daughter of Sir John Mills and Mary Hayley Bell, and younger sister of actress Juliet Mills, Mills began her acting career as a child and was hailed as a promising newcomer, winning the BAFTA Award for Most Promising Newcomer for her performance in the British crime drama film "Tiger Bay" (1959), the Academy Juvenile Award for Disney\'s "Pollyanna" (1960) and Golden Globe Award for New Star of the Year\xa0– Actress in 1961. During her early career, she appeared in six films for Walt Disney, including her dual role as twins Susan and Sharon in the Disney film "The Parent Trap" (1961). Her performance in "Whistle Down the Wind" (a 1961 adaptation of the novel written by her mother) saw Mills nominated for BAFTA Award for Best British Actress.', 'title': 'Hayley Mills'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Song to the Sun, known in Japan as Taiyō no Uta (タイヨウのうた , Song of the Sun ) , is a movie directed by Norihiro Koizumi starring the Japanese artist and singer Yui. In the movie, she plays the role of Kaoru Amane (雨音 薫 "Amane Kaoru"), a 16-year-old girl who has the rare skin condition xeroderma pigmentosum (XP), a disease that makes the ultraviolet radiation of sunlight potentially lethal to her. Yui\'s character is partly based on herself, as she is a singer and guitarist, and she performs three of Yui\'s songs in the movie; "It\'s Happy Line", "Good-bye Days" and "Skyline". There has been a 2006 Japanese TV drama starring Takayuki Yamada and Erika Sawajiri, a manga by Bandō Kenji and Minatsuki Tsunami, a 2015 Vietnamese / Japanese drama, and a 2017 American remake, all based on the movie.', 'title': 'Midnight Sun (2006 film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Richard Crispin Armitage (born 22 August 1971) is an English film, television, theatre and voice actor. He received notice in the UK with his first leading role as John Thornton in the British television programme "North & South" (2004). But it was his role as dwarf prince and leader Thorin Oakenshield in Peter Jackson\'s film trilogy adaptation of "The Hobbit" that first brought him international recognition. Other notable roles include John Proctor in Yaël Farber’s stage production of Arthur Miller\'s "The Crucible", Francis Dolarhyde in the American TV series "Hannibal", Lucas North in the British TV drama "Spooks", John Porter in the British TV drama "Strike Back", and Guy of Gisborne in the British TV drama "Robin Hood". He more recently voiced Trevor Belmont in the Netflix adaptation of "Castlevania".', 'title': 'Richard Armitage (actor)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Back Home is a children\'s historical novel by Michelle Magorian, first published in 1984. The novel was adapted into a TV drama, "Back Home" (1990), starring Hayley Mills and Haley Carr, and again in 2001 starring Sarah Lancashire, Stephanie Cole and Jessica Fox.', 'title': 'Back Home (novel)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Lucan was a TV drama starring Kevin Brophy that aired on ABC from 1977 to 1978. The series was based on an earlier May 22, 1977 made-for-TV movie of the same name directed by David Greene starring John Randolph and Kevin Brophy, along with Stockard Channing, Ned Beatty and Lou Frizzell.', 'title': 'Lucan (TV series)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Diane Keen (born 29 July 1946) is an English actress, who starred in the British TV drama "Doctors" in which she played Julia Parsons from 2003-2012. She is also known for starring in the 1970s comedy series "The Cuckoo Waltz" and "Rings on Their Fingers", and for her many appearances in Nescafé coffee advertisements during the 1970s and 1980s.', 'title': 'Diane Keen'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Elizabeth White (born 5 November 1979) is an English actress born in Rotherham, South Yorkshire. She is best known for her role as Annie Cartwright in the two series of the BBC speculative fiction drama "Life on Mars", which was originally transmitted in 2006 and 2007. She was trained at the Liverpool Institute of Performing Arts, appearing in the 2003 TV series "Teachers" and the 2004 Mike Leigh\'s film "Vera Drake".', 'title': 'Liz White (actress)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Strumpet City is a 1969 historical novel by James Plunkett set in Dublin, Ireland, around the time of the 1913 Dublin Lock-out. In 1980, it was adapted into a successful TV drama by Hugh Leonard for RTÉ, Ireland's national broadcaster. The novel is an epic, tracing the lives of a dozen characters as they are swept up in the tumultuous events that affected Dublin between 1907 and 1914.", 'title': 'Strumpet City'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Michelle Magorian (born 6 November 1947) is an English author of children\'s books. She is best known for her first novel, "Goodnight Mister Tom", which won the 1982 Guardian Prize for British children\'s books and has been adapted several times for screen or stage. Two other well-known works are "Back Home" and "A Little Love Song". She now resides in Petersfield, Hampshire, with her two children Tom and George.', 'title': 'Michelle Magorian'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"We\'ll Never Have to Say Goodbye Again" is a song by Jeffrey Comanor from the album "A Rumor in His Own Time", which debuted in September 1976. Written by Comanor, the song describes a couple who spend a night together, one which the narrator wishes would "never end". Both the song, which Epic Records released as a single, and album failed to chart. Discovered four months later by Arista Records President Clive Davis, "We\'ll Never Have to Say Goodbye Again" was covered by soft rock duo Deardorff & Joseph for their eponymous debut album, released on Arista. After Deardorff & Joseph disbanded, Marcia Day, who managed Maureen McGovern, became the manager of Deardorff, while Susan Joseph, who managed England Dan & John Ford Coley, became the manager of Joseph. Both McGovern and England Dan & John Ford Coley released covers of "We\'ll Never Have to Say Goodbye Again" in February 1978; while McGovern\'s failed to chart, Dan & Coley\'s spent six weeks at number one on the "Billboard" US Easy Listening chart, reached number two on the "RPM" Canada Adult Contemporary chart, and went to numbers nine and eleven on the magazines\' respective overall charts.', 'title': "We'll Never Have to Say Goodbye Again"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"Never Say Goodbye" is a song by American rock band Bon Jovi, written by Jon Bon Jovi and Richie Sambora. It was a track off the band\'s third album, "Slippery When Wet", in June 1987, and reached number 11 on the mainstream rock charts and number 21 in the UK Singles Chart. Because it was not released domestically as a commercially available single, "Never Say Goodbye" was ineligible to chart on the "Billboard" Hot 100; nevertheless, it reached number 28 on the Hot 100 Airplay survey.', 'title': 'Never Say Goodbye (Bon Jovi song)'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': '"I Will Not Say Goodbye" is a song written by Lari White, Chuck Cannon and Vicky McGehee, and recorded by "American Idol" season 8 finalist Danny Gokey. It was released in June 2010 as the second single from his debut album "My Best Days", which was released on March 2, 2010 via RCA Nashville.', 'title': 'I Will Not Say Goodbye'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Lari Michele White ( ; born May 13, 1965) is an American country music artist and actress. She first gained national attention in 1988 as a winner on "You Can Be a Star", a talent competition which aired on The Nashville Network. A recording contract with RCA Records Nashville followed a year later, producing three studio albums, a greatest hits package, and several chart singles, with three of her singles having reached Top Ten: "That\'s My Baby" and "That\'s How You Know (When You\'re In Love)" at No.\xa010, and "Now I Know" at No.\xa05. A fourth studio album was released in 1998 on Lyric Street Records, followed by two more releases on White\'s own label, Skinny White Girl. Overall, White has charted 12 times on the "Billboard" country music charts.', 'title': 'Lari White'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'William Harold Dean Jr. (born April 2, 1962) is an American country music singer and songwriter. Billy Dean first gained national attention after appearing on the television talent competition "Star Search". Active as a recording artist since 1990, he has recorded a total of eight studio albums (of which the first three have been certified gold by the RIAA) and a greatest hits package which is also certified gold. His studio albums have accounted for more than 20 hit singles on the "Billboard" country charts, including 11 Top Ten hits. In 2000, he had a Billboard Number one as a guest artist along with Allison Kraus on Kenny Rogers\' "Buy Me a Rose", and had two Number Ones on the "RPM" country charts in Canada.', 'title': 'Billy Dean'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': '"Song to Say Goodbye" is the second single from Placebo\'s fifth studio album, "Meds". It was produced by Dimitri Tikovoi. The first single, "Because I Want You" was only released in the United Kingdom, so elsewhere, "Song to Say Goodbye" is considered the first single from "Meds". The song develops around piano notes that repeat throughout it. The song deals with heroin addiction and its influence on the relationships of the parties involved.', 'title': 'Song to Say Goodbye'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"She Even Woke Me Up to Say Goodbye" is a song written by Doug Gilmore and Mickey Newbury, and recorded by American country music artist Jerry Lee Lewis. Released in September 1969, it was the first single from his album "She Even Woke Me Up to Say Goodbye". The song peaked at number 2 on the "Billboard" Hot Country Singles chart. It also reached number 1 on the "RPM" Country Tracks chart in Canada.', 'title': 'She Even Woke Me Up to Say Goodbye'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Joel Philip Stacey (born January 21, 1978) is an American singer who first gained national attention on season 6 of the television talent show "American Idol". After being eliminated from the competition on May 2, 2007, he was signed to a recording contract with Lyric Street Records. His debut single, "If You Didn\'t Love Me", was released to radio in early 2008 as the lead-off to his self-titled debut album, which was issued April 29, 2008 on Lyric Street. Stacey\'s second album, "Into the Light", was released on August 25, 2009 via Reunion Records.', 'title': 'Phil Stacey'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"It\'s So Hard to Say Goodbye to Yesterday" is an R&B song written by Motown husband-and-wife songwriting team Freddie Perren and Christine Yarian for the 1975 film "Cooley High". In the film, the song is performed by Motown artist G.C. Cameron, whose rendition peaked at number 38 on the "Billboard" R&B singles chart that same year. Perren also composed the instrumental score for "Cooley High", and the B-side to "It\'s So Hard to Say Goodbye to Yesterday" features two of his score compositions from the film.', 'title': "It's So Hard to Say Goodbye to Yesterday"}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Don\'t Say Goodbye" is a song by Mexican recording artist Paulina Rubio, from her sixth studio album "Border Girl" (2002). It was written by Cheryl Yie and Joshua \'Gen\' Rubin and was produced and arranged by Gen Rubin himself. "Don\'t Say Goodbye" was released as the album\'s first single by Universal Records on April 30, 2002.', 'title': "Don't Say Goodbye (Paulina Rubio song)"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': '"Saturday\'s Child" is a popular song, written by David Gates and performed by The Monkees. The song is an electric guitar–based rock song. The song is now widely regarded as one of their best album tracks, with AMG critic Matthew Greenwald saying that it has a "proto-heavy metal guitar riff" and it is "one of the more interesting curios of the early Monkees catalog". The song still gets regular play on Oldies radio stations and has also been covered by several artists. The song is also featured on several "greatest hits" albums by The Monkees. The song was originally the second track on their self-titled debut album "The Monkees" with Micky Dolenz on lead vocals. The promotional video, which aired during the 26 September 1966 "Monkee vs. Machine" television show, features The Monkees playing around on the beach and having fun with five children (at any one time), in a dune buggy, on a swing set, on slides, on a jungle gym, on a horse, on unicycles, and on Honda Super Cub motorcycles, and hamming it up driving the Monkeemobile around Southern California.', 'title': "Saturday's Child"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Tear Drop City is a single by The Monkees released on February 8, 1969 on Colgems #5000 recorded on October 26, 1966. The song reached No. 56 on the Billboard chart. The lyrics are about a man who feels low because his girlfriend has left him. Written by Tommy Boyce and Bobby Hart, it was the first single The Monkees released as a trio (Micky Dolenz, Michael Nesmith, and Davy Jones; Peter Tork departed December 1968). Micky Dolenz performed the lead vocal. Boyce and Hart produced and arranged the song.', 'title': 'Tear Drop City'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'George Michael Dolenz, Jr. (born March 8, 1945) is an American actor, musician, television director, radio personality and theater director, best known as a vocalist and drummer of the 1960s pop/rock band the Monkees.', 'title': 'Micky Dolenz'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Dolenz, Jones, Boyce & Hart is an album by the group of the same name, released in 1976. The group consisted of Micky Dolenz, Davy Jones, Tommy Boyce and Bobby Hart. Dolenz and Jones had been members of 1960s pop group/band The Monkees while Boyce and Hart had written many of the group\'s biggest hits such as "Last Train to Clarksville" and "(Theme from) The Monkees". As such, several publications, such as Allmusic, consider the album to be a Monkees-reunion album. Most of the musicians that appear on this album were featured on Monkees albums in the past. A majority of the vocals are done by Dolenz and Jones ("Right Now", "I Remember The Feeling", "You And I") with Boyce And Hart contributing backing vocals and the occasional lead vocal such as Hart\'s on "I Love You [And I\'m Glad That I Said It]". Although the album failed to make much of an impact when originally released, renewal of interest in The Monkees led to its reissue on compact disc years later. The group was called Dolenz, Jones, Boyce & Hart because they were legally prohibited from using The Monkees name. Former Monkees members Michael Nesmith and Peter Tork were also invited to join the group, but they both declined. Peter Tork joined \'Dolenz, Jones, Boyce, & Hart\' onstage for a guest appearance on their concert tour on July 4, 1976 in Disneyland. Later that year he reunited with Jones and Dolenz in the studio for the recording of the single "Christmas is My Time of the Year" b/w "White Christmas", which saw a limited release for fan club members that holiday season.', 'title': 'Dolenz, Jones, Boyce &amp; Hart'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"(Theme from) "The Monkees"" is a 1966 popular song, written by Tommy Boyce and Bobby Hart as the theme song for the TV series "The Monkees". Two versions were recorded - one for their first album "The Monkees" and a second shorter version designed to open the television show. Both versions feature vocals by Micky Dolenz. The full length version was released as a single in several countries including Australia, where it became a hit, reaching #8. It also made "Billboard Magazine"<nowiki>\'</nowiki>s "Hits of the World" chart in both Mexico and Japan, reaching the Top 20 in Japan and the Top 10 in Mexico (#2 Jun.17, 1967). It is still played on many oldies radio stations. An Italian version of the song was featured on a Monkees compilation album. Ray Stevens did a version of the Monkees Theme song on his 1985 album "He Thinks He\'s Ray Stevens" featuring a male German group of singers, Wolfgang and Fritzy, that are arguing during the refrain of the song. ("Hey Hey Bist Du Monkees".)', 'title': '(Theme From) The Monkees'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': "Thomas Anders (born Bernd Weidung, 1 March 1963) is a German singer, composer, and record producer. Anders was the lead singer of Germany's popular pop-duo Modern Talking in 1983–1987 and in 1998–2003.", 'title': 'Thomas Anders'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': '"Last Train to Clarksville" was the debut single by The Monkees. It was released August 16, 1966 and later included on the group\'s 1966 self-titled album, which was released on October 10, 1966. The song, written by Tommy Boyce and Bobby Hart was recorded at RCA Victor Studio B in Hollywood on July 25, 1966 and was already on the Boss Hit Bounds on 17 August 1966. The song topped the "Billboard" Hot 100 on November 5, 1966. Lead vocals were performed by The Monkees\' drummer Micky Dolenz. "Last Train to Clarksville" was featured in seven episodes of the Monkees TV show; the most for any Monkees song.', 'title': 'Last Train to Clarksville'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': '"Randy Scouse Git" is a song written by Micky Dolenz in 1967 and recorded by The Monkees. It was the first song written by Dolenz to be commercially released, and became a #2 hit in the UK where it was retitled "Alternate Title" after the record company (RCA) complained that the original title was actually somewhat "taboo to the British audience". Dolenz took the song\'s title from a phrase he had heard spoken on an episode of the British television series "Till Death Us Do Part", which he had watched while in England. The song also appeared on "The Monkees" TV series, on their album "Headquarters," and on several "Greatest Hits" albums. Peter Tork has said that it is one of his favorite Monkees tracks.', 'title': 'Randy Scouse Git'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': '"Oh My My" is a song by The Monkees, released on April 1, 1970 on Colgems single #5011. It was the final single released during their original 1966-70 run. The song was written by Jeff Barry and Andy Kim and recorded February 5, 1970. It made it to #98 on the "Billboard" Hot 100 chart, their last entry until 1986. The B-side was "I Love You Better", also written by Barry and Kim. By now, The Monkees were a duo consisting of Micky Dolenz and Davy Jones, and both sides of the single were sung by Dolenz. Both songs are from "Changes", The Monkees\' final studio album until 1987\'s "Pool It! " which was followed by "Good Times" in 2016.', 'title': 'Oh My My (The Monkees song)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Janelle Johnson (December 2, 1923 - December 2, 1995) was a film actress of the 1940s. She married actor George Dolenz (1908–63) and was the mother of Micky Dolenz of the 1960s pop group the Monkees. Her English daughter-in-law was Samantha Juste, co-host of BBC television\'s "Top of the Pops" in its early days. Her granddaughter, Ami Dolenz, also became a film actress.', 'title': 'Janelle Johnson'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Jeff Friedman is an American poet and professor. He is the author of five books of poetry, "Black Threads", (Carnegie Mellon University Press, 2007), "Taking Down the Angel" (Carnegie Mellon University Press, 2003), "Scattering the Ashes" (selected in the open competition for the Carnegie Mellon University Press Poetry Series, 1998) and "The Record-Breaking Heat Wave" (BkMk Press-University of Missouri-Kansas City, 1986). His fifth book, "Working in Flour" is coming out soon on Carnegie Mellon University Press.', 'title': 'Jeff Friedman'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'The University of New Haven (UNH) is a private, nonsectarian, coeducational university located in West Haven, Connecticut, which borders the larger city of New Haven and Long Island Sound. U.S. News & World Report has named the University the 100th best university in the northeastern United States as well as in the top tier of engineering programs nationwide in its annual "America\'s Best Colleges" rankings. Between its main campus in West Haven and its graduate school campus in Orange, Connecticut, the University is situated on approximately 122 acres of land. Combining a liberal arts education with professional training, the University comprises six degree-granting colleges: the College of Arts and Sciences, the Lyme Academy College of Fine Arts, the College of Business, the Tagliatela College of Engineering, the Henry C. Lee College of Criminal Justice and Forensic Sciences, and the College of Lifelong & eLearning for adult and online students.', 'title': 'University of New Haven'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Gloriana St. Clair (born 1939) is a pioneer in the field of academic librarianship, as well as a scholar of Norse Mythology and its relationship to the works of J.R.R. Tolkien. She is currently the Principal Investigator of the Olive Executable Archive as well as the official University Liaison to the Pittsburgh chapter of the Osher Lifelong Learning Institute at Carnegie Mellon University. She is Dean Emerita of Carnegie Mellon University Libraries (1998-2013). Before coming to Carnegie Mellon, St. Clair held leadership positions at several other universities. St. Clair attended the University of California, Berkeley, receiving a bachelor's degree in English in 1962 and a master's degree in library science in 1963.", 'title': 'Gloriana St. Clair'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Mellon College of Science (MCS) at Carnegie Mellon University in Pittsburgh, Pennsylvania, USA houses the Chemistry, Mathematical Sciences, Physics, and Biological Sciences departments. In addition, it oversees several interdisciplinary research centers. MCS also awards the Dickson Prize in Science. The college is named for the Mellon family, founders of the Mellon Institute of Industrial Research, a predecessor of Carnegie Mellon University.', 'title': 'Mellon College of Science'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Venkatesan Guruswami (born 1976) is a computer scientist at Carnegie Mellon University in Pittsburgh, United States. He did his schooling at Padma Seshadri Bala Bhavan in Chennai, India. He completed his undergraduate in Computer Science from IIT Madras and his doctorate from Massachusetts Institute of Technology under the supervision of Madhu Sudan in 2001 . After receiving his PhD, he spent a year at UC Berkeley as a Miller Fellow, and then was a member of the faculty at the University of Washington from 2002 to 2009. His primary area of research is computer science, and in particular on error-correcting codes. Following 2007, he was on leave from University of Washington. During 2007-2008, he visited the Institute for Advanced Study as a Member of School of Mathematics. He also visited SCS at Carnegie Mellon University during 2008-09 as a Visiting Faculty. In July 2009, he joined the School of Computer Science at Carnegie Mellon University as Associate Professor in the Computer Science Department.', 'title': 'Venkatesan Guruswami'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': "Carnegie Mellon University in Qatar (Arabic: جامعة كارنيجي ميلون في قطر), is one of the branch campuses of Carnegie Mellon University, located in Doha, Qatar. It is Carnegie Mellon's first undergraduate branch campus, is a member of the Qatar Foundation, and began graduating students in May 2008.", 'title': 'Carnegie Mellon University in Qatar'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Dzvinia Orlowsky is a Ukrainian American poet, translator, editor, and professor. She is author of five poetry collections including "Convertible Night, Flurry of Stones" (Carnegie Mellon University Press, 2009) and her most recent, "Silvertone "(Carnegie Mellon University Press, 2013)" ." She is co-winner of the Sheila Motton Book Award. Her first collection, "A Handful of Bees", was reprinted in 2009 as a Carnegie Mellon University Classic Contemporary.', 'title': 'Dzvinia Orlowsky'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Lori L. Holt is a Professor of Psychology at Carnegie Mellon University. She specializes in speech perception, focusing on how general perceptual and cognitive mechanisms contribute to speech perception and how speech can be used to broadly understand auditory cognition. In pursuit of these research areas, she employs human perceptual and learning paradigms as well as animal behavioral experiments and computational models. Holt received a B.S. in psychology from the University of Wisconsin–Madison in 1995 and a Ph.D. in cognitive psychology with a minor in neurophysiology from UW–Madison in 1999, and she has been employed at Carnegie Mellon University and has been a member of the Center for the Neural Basis of Cognition ever since. Holt is the director of the Speech Perception & Learning Laboratory at Carnegie Mellon University. She was one of two recipients of the Troland Research Awards in 2013.', 'title': 'Lori L. Holt'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Carnegie Mellon University (Carnegie Mellon or CMU or ) is a private research university in Pittsburgh, Pennsylvania.', 'title': 'Carnegie Mellon University'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Carnegie Mellon University Usable Privacy and Security Laboratory (CUPS) was established in the Spring of 2004 to bring together Carnegie Mellon University researchers working on a diverse set of projects related to understanding and improving the usability of privacy and security software and systems. The privacy and security research community has become increasingly aware that usability problems severely impact the effectiveness of mechanisms designed to provide security and privacy in software systems. Indeed, one of the four grand research challenges in information security and assurance identified by the Computing Research Association in 2003 is: "Give end-users security controls they can understand and privacy they can control for the dynamic, pervasive computing environments of the future." This is the challenge that CUPS strives to address. CUPS is affiliated with Carnegie Mellon CyLab and has members from the Engineering and Public Policy Department, the School of Computer Science, the Electrical and Computer Engineering Department, the Heinz College, and the Department of Social and Decision Sciences.', 'title': 'CUPS (CMU)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Jaye Amber Radisich (29 March 1976\xa0– 17 March 2012) was an Australian politician. She was an Australian Labor Party member of the Western Australian Legislative Assembly from 2001 to 2008, representing the electorate of Swan Hills. Radisich was the youngest woman ever to be elected to the Western Australian parliament.', 'title': 'Jaye Radisich'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Matt Doheny is an American businessman, lawyer, and politician. He was a Republican candidate for the United States Congress in New York State in 2010 and 2012, losing narrowly on both occasions to Democrat Bill Owens. In 2014, he ran in the Republican primary for New York's 21st congressional district. Doheny lost the primary to Elise Stefanik, who subsequently went on to win the general election.", 'title': 'Matt Doheny'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Esto Bates Broughton (January 9, 1890 – November 20, 1956) was an American lawyer, journalist, publicist, and politician, one of the first four women to serve in the California State Assembly when they were elected in 1918. Broughton, who was sworn into office at age 29, was also the youngest woman ever to serve in the California legislature, until her record was broken in 2002.', 'title': 'Esto Bates Broughton'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Paula Fickes Hawkins (January 24, 1927 – December 4, 2009) was an American politician from Florida. To date, she is the only woman elected to the U.S. Senate from Florida. She was the second woman ever elected to the Senate from the South and the first in the country ever elected to a full Senate term without a family connection.', 'title': 'Paula Hawkins'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Sarah Coral Hanson-Young (née Hanson; born 23 December 1981) is an Australian politician who has been a Senator for South Australia since July 2008, representing the Australian Greens. She is the youngest woman ever to sit in federal parliament, winning election at the age of 25 and taking office at the age of 26. She is also the youngest person ever elected to the Senate (several others have been appointed at younger ages).', 'title': 'Sarah Hanson-Young'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Caroline Casagrande (born November 21, 1976) is an American Republican Party politician, who has served in the New Jersey General Assembly representing the 11th Legislative District from January 10, 2012 to January 12, 2016. Prior to the 2011 legislative redistricting, she served in the Assembly from January 8, 2008 representing the 12th District. She is the youngest woman assembly member ever elected in New Jersey. She was defeated for re-election in 2015.', 'title': 'Caroline Casagrande'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Blanche Meyers Lambert Lincoln (born September 30, 1960) is a former U.S. Senator from Arkansas who served from 1999 to 2011. Lincoln, a member of the Democratic Party, was first elected to the Senate in 1998; she was the first woman elected to the Senate from Arkansas since Hattie Caraway in 1932 and, at age 38, was the youngest woman ever elected to the Senate. She previously served in the U.S. House of Representatives, representing 2=nd', 'title': 'Blanche Lincoln'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Louise Clare Pratt (born 18 April 1972) is an Australian politician. She was a Labor member of the Australian Senate from July 2008 until June 2014, representing the state of Western Australia, and returned to the Senate after the 2016 election. She had been assured of election at the 2007 federal election after winning the first position on the Labor ticket, defeating incumbent Senator Ruth Webber in a preselection contest. Pratt previously served as a member of the Western Australian Legislative Council from 2001 to 2007. She was the youngest woman ever elected to the Legislative Council at the time of her election, the second open lesbian to be elected to an Australian parliament, and was the first to have a transgender man as a partner.', 'title': 'Louise Pratt'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': "Elise Marie Stefanik (born July 2, 1984) is an American politician from the state of New York. She is a member of the Republican Party and a member of the United States House of Representatives in New York 's 21 congressional district . She is the youngest woman ever elected to Congress, elected in 2014 at age 30.", 'title': 'Elise Stefanik'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "Roslyn Dundas (born 28 July 1978) is a former Australian politician. She was an Australian Democrats member of the Australian Capital Territory Legislative Assembly from 2001 to 2004, when she was defeated in a bid for re-election. Until Kelly Vincent's election to the South Australian Legislative Council in 2010, Dundas was the youngest woman ever elected to an Australian parliament.", 'title': 'Roslyn Dundas'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Symphony No. 5 is a symphony for orchestra by the American composer Christopher Rouse. The work was jointly commissioned by the Dallas Symphony Orchestra, the Nashville Symphony, and the Aspen Music Festival. It was completed in Baltimore on February 15, 2015, and was first performed by the Dallas Symphony Orchestra under the direction of Jaap van Zweden at the Morton H. Meyerson Symphony Center on February 9, 2017.', 'title': 'Symphony No. 5 (Rouse)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "The Clarinet Concerto is a concerto for clarinet and orchestra by the American composer Christopher Rouse. The work was commissioned for the Chicago Symphony Orchestra and its principal clarinetist Larry Combs by the Institute for American Music. It was completed December 11, 2000 and premiered May 17, 2001 at Symphony Center in Chicago with Christoph Eschenbach conducting the Chicago Symphony Orchestra. The piece is dedicated to Rouse's friend and fellow composer Augusta Read Thomas.", 'title': 'Clarinet Concerto (Rouse)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Soundings is an orchestral composition by the American composer Elliott Carter. The work was commissioned by the Chicago Symphony Orchestra for their final season with the conductor Daniel Barenboim as music director. It was first performed on October 6, 2005 at the Symphony Center, Chicago, by Barenboim and the Chicago Symphony Orchestra.', 'title': 'Soundings (Carter)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Proceed, Moon: Fantasy for Orchestra is an orchestral composition by the American composer Melinda Wagner. The work was Wagner's third commission from the Chicago Symphony Orchestra, which first performed the piece under the conductor Susanna Mälkki at the Symphony Center, Chicago, on June 15, 2017. Wagner dedicated the score to Mälkki and the Chicago Symphony Orchestra.", 'title': 'Proceed, Moon'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Seamstress is a concerto for solo violin and orchestra by the British-born composer Anna Clyne. The work was commissioned by the Chicago Symphony Orchestra, for which Clyne was then composer-in-residence. It was first performed May 28, 2015 at Symphony Center, Chicago by the violinist Jennifer Koh and the Chicago Symphony Orchestra under conductor Ludovic Morlot. "The Seamstress" marks the second collaboration between Clyne and Koh, who had previously premiered Clyne\'s double violin concerto "Prince of Clouds" in November 2012.', 'title': 'The Seamstress (Clyne)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Spangled Unicorn is a composition for brass ensemble by the British-born composer Anna Clyne. The work was commissioned by the Chicago Symphony Orchestra, for which Clyne was then composer-in-residence. It was first performed on March 21, 2011 at Symphony Center, Chicago by the brass section of the Chicago Symphony Orchestra.', 'title': 'Spangled Unicorn'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Symphony Center is a music complex located at 220 South Michigan Avenue in the Loop area of Chicago, Illinois. Home to the Chicago Symphony Orchestra; Chicago Symphony Chorus; Civic Orchestra of Chicago; and the Institute for Learning, Access, and Training; Symphony Center includes the 2,522-seat Orchestra Hall, which dates from 1904; Buntrock Hall, a rehearsal and performance space; Grainger Ballroom, an event space overlooking Michigan Avenue and the Art Institute of Chicago; a public multi-story rotunda; tesori restaurant; and administrative offices. In June 1993, plans to significantly renovate and expand Orchestra Hall were approved and the $110 million project resulting in Symphony Center began in 1995 and was completed in 1997.', 'title': 'Symphony Center'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Alternative Energy is a symphony for electronica and orchestra in four movements by the American composer Mason Bates. The work was commissioned by the Chicago Symphony Orchestra, for whom Bates was then composer-in-residence. It was premiered by the orchestra under conductor Riccardo Muti at Symphony Center in Chicago, February 2, 2012.', 'title': 'Alternative Energy (composition)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Anthology of Fantastic Zoology is an orchestral symphony by the American composer Mason Bates. The work was commissioned by the Chicago Symphony Orchestra, for whom Bates was then composer-in-residence. It was premiered June 18, 2015 at Symphony Center in Chicago, with the Chicago Symphony Orchestra performing under conductor Riccardo Muti, to whom the work is dedicated. The piece is based on the eponymous book by Jorge Luis Borges.', 'title': 'Anthology of Fantastic Zoology'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Night Ferry is an orchestral composition in one movement by the British-born composer Anna Clyne. The work was commissioned by the Chicago Symphony Orchestra, for which Clyne was then composer-in-residence. It was first performed February 9, 2012 at Symphony Center, Chicago by the Chicago Symphony Orchestra under conductor Riccardo Muti.', 'title': 'Night Ferry (composition)'}]

