[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Ingram–Schipper Farm is a historic farm complex located near Boonsboro, Washington County, Maryland, United States. It is a two-story, four-bay Flemish bond brick dwelling with white trim and water table. The house features a Victorian period flat-roofed one-story porch and a slate roof. The property includes a number of early outbuildings, including a brick kitchen and wash house, three log buildings, one of which has a fireplace and appears to have been a dwelling, and a large stone barn.', 'title': 'Ingram–Schipper Farm'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Lemoyne is an unincorporated community and census-designated place in northern Keith County, Nebraska, United States. It lies along Nebraska Highway 92 on the northern shore of Lake C.W. McConaughy, north of the city of Ogallala, the county seat of Keith County. Its elevation is 3,333\xa0feet (1,016\xa0m). Although Lemoyne is unincorporated, it has a post office, with the ZIP code of 69146.', 'title': 'Lemoyne, Nebraska'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Kingsley Dam is located on the east side of Lake McConaughy in central Keith County, Nebraska, and is the second largest hydraulic fill dam in the world. It was built as part of the New Deal project. The dam is 162 ft tall, 3.1 mi long, and 1100 ft wide at its base. On the east side of the dam is Lake Ogallala and on the south side is the Kingsley Hydroelectricity Plant. The Nebraska Game and Parks Commission and Central Nebraska Public Power and Irrigation District are also located in this area. Kingsley Dam, the Kingsley Hydroelectricity Plant, the Morning Glory Spillway, and the Outlet Tower – a large structure near the dam used to release water from the lake – are main visual icons of Lake McConaughy.', 'title': 'Kingsley Dam'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Keystone is an unincorporated community and census-designated place in central Keith County, Nebraska, United States. It lies along local roads near the North Platte River, northeast of the city of Ogallala, the county seat of Keith County. Its elevation is 3,100\xa0feet (945\xa0m). Although Keystone is unincorporated, it has a post office, with the ZIP code of 69144.', 'title': 'Keystone, Nebraska'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Ogallala is a city in Keith County, Nebraska, United States. The population was 4,737 at the 2010 census. It is the county seat of Keith County. In the days of the Nebraska Territory, the city was a stop on the Pony Express and later along the transcontinental railroad. The Ogallala Aquifer was named after the city.', 'title': 'Ogallala, Nebraska'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Dune Dam is a long sand dune that lies at the western end of Chaco Canyon, New Mexico, near the confluence of the Chaco and Escavada Washs. The dune was created by winds that brought sand up the Chaco River. When the dune was large enough, it dammed the Chaco Wash and created a small and shallow lake near the Ancestral Puebloan great house, Penasco Blanco. Archeological evidence suggests that the dune was breached around 900 CE. Chacoans filled the breach with masonry sometime in the early 11th century, and built an accompanying reservoir lined with stones that was visible until 1920. The dam stopped Chaco Wash from further deepening, which helped raise the water table in the canyon, aiding Chacoan farming. The absence of a lacustrine plain behind the dam led geologist Stephen A. Hall to question this interpretation.', 'title': 'Dune Dam'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Keith County is a county located in the U.S. state of Nebraska. As of the 2010 census, the population was 8,368. Its county seat is Ogallala.', 'title': 'Keith County, Nebraska'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "The Ogallala Aquifer is a shallow water table aquifer surrounded by sand, silt, clay and gravel located beneath the Great Plains in the United States. One of the world's largest aquifers, it underlies an area of approximately 174000 sqmi in portions of eight states (South Dakota, Nebraska, Wyoming, Colorado, Kansas, Oklahoma, New Mexico, and Texas). It was named in 1898 by geologist N. H. Darton from its type locality near the town of Ogallala, Nebraska. The aquifer is part of the High Plains Aquifer System, and rests on the Ogallala Formation, which is the principal geologic unit underlying 80% of the High Plains.", 'title': 'Ogallala Aquifer'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Souris Beach Provincial Park is a day-use provincial park located near the town of Souris in eastern Prince Edward Island, Canada. The beach is very shallow, allowing visitors to walk several hundred feet from shore on an all sand bottom. The shallow water also results in the waters at this beach being warmer, as a result of warming by the sun, than other Island beaches where depths increase more quickly.', 'title': 'Souris Beach Provincial Park'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Flatwood is a soil series with impaired drainage that occurs in the southeastern United States. Flatwood soils are upland soils formed from marine sediments. A shallow water table plays a role in soil formation, typically the water table is only a few feet deep and fluctuates during the year. Flatwood soils are classified in USDA soil taxonomy as fine, mixed, semiactive, mesic Aquic Hapludults.', 'title': 'Flatwood'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'In music, a duodecet—sometimes duodectet, or duodecimette—is a composition which requires twelve musicians for a performance, or a musical group that consists of twelve people. In jazz, such a group of twelve players is sometimes called a "twelvetet". The corresponding German word is duodezett. The French equivalent form, douzetuor, is virtually unknown (in sharp contrast to "dixtuor", the French word for decet). Unlike some other musical ensembles such as the string quartet, there is no established or standard set of instruments in a duodecet.', 'title': 'Duodecet'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 2003 Marriott Hotel bombing occurred on 5 August 2003 in Mega Kuningan, South Jakarta, Indonesia. A suicide bomber detonated a car bomb outside the lobby of the JW Marriott Hotel, killing twelve people and injuring 150. Those killed were mostly Indonesian, with the exception of one Dutch man. The hotel was viewed as a Western symbol, and had been used by the United States embassy for various events. The hotel was closed for five weeks and reopened to the public on 8 September.', 'title': '2003 Marriott Hotel bombing'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Human Centipede 2 (Full Sequence) is a 2011 Dutch black and white exploitation-horror film written, directed, and co-produced by Dutch filmmaker Tom Six. The sequel to Six\'s 2009 film "The Human Centipede (First Sequence)", the film stars Laurence R. Harvey as a mentally impaired English man who watches and becomes obsessed with the first "Human Centipede" film, and decides to make his own "centipede" consisting of twelve people, including Ashlynn Yennie, an actress from the first film.', 'title': 'The Human Centipede 2 (Full Sequence)'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Ted Kooshian (born October 8, 1961) is an American jazz pianist, keyboardist, and composer, who has performed with Aretha Franklin, Chuck Berry, Marvin Hamlisch, Sarah Brightman, Il Divo, and Blood, Sweat, and Tears. Kooshian has played in many Broadway pit orchestras, and has been a member of the Ed Palermo Big Band since 1994. Originally from San Jose, California, Kooshian has been performing since the 1980s.', 'title': 'Ted Kooshian'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "During President Ronald Reagan's presidency, he nominated at least twelve people for various federal appellate judgeship who were not confirmed. In some cases, the nominations were not processed by the Democratic-controlled Senate Judiciary Committee before Reagan's presidency ended, while in other cases, nominees were rejected by the Senate Judiciary Committee or even blocked by unfriendly members of the Republican Party. Three of the nominees were renominated by Reagan's successor, President George H. W. Bush. Two of the nominees, Ferdinand Francis Fernandez and Guy G. Hurlbutt, were nominated after July 1, 1988, the traditional start date of the unofficial Thurmond Rule during a presidential election year. Eight of the twelve seats eventually were filled by appointees of President George H. W. Bush.", 'title': 'Ronald Reagan judicial appointment controversies'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Castelldefels train accident occurred on 23\xa0June 2010 when a passenger train struck a group of people who were crossing the railway on the level at Platja de Castelldefels station to the southwest of Barcelona, in Catalonia, Spain. Twelve people were killed, and fourteen injured: all victims but one Romanian were of Latin American origin, with a majority from Ecuador.', 'title': 'Castelldefels train accident'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Robert Lopez (born February 23, 1975) is an American songwriter of musicals, best known for co-creating "The Book of Mormon" and "Avenue Q", and for composing the songs featured in the Disney animated film "Frozen". He is the youngest of only twelve people who have won an Emmy, a Grammy, an Oscar and a Tony Award, and the quickest (10 years) to win all four.', 'title': 'Robert Lopez'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "A people's jury, or citizen's jury, is an institution used by a democratically elected body to resolve a divisive issue, in order to reach a consensus. An example, which occurred in Oxfordshire in the late 1990s, was the use of a people's jury to resolve where to site a waste recycling plant. A group of twelve people was selected as though they were going to belong to a legal jury. They were then taken on a guided tour of the county and introduced to experts in various fields. After they had been given the opportunity to perform sufficient research, they were asked to choose the site to use.", 'title': "People's jury"}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Clement Arthur Milton (10 March 1928 – 25 April 2007) was an English cricketer and footballer. He played County cricket for Gloucestershire from 1948 to 1974, playing six Test matches for England in 1958 and 1959. He also played domestic football for Arsenal between 1951 and 1955, and then for a brief period for Bristol City. He played one match for England in 1951, against Austria at Wembley. He was the last man, and the last survivor, of the twelve people to have played at the highest international level for both England's football and cricket teams.", 'title': 'Arthur Milton'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Marvin Frederick Hamlisch (June 2, 1944August 6, 2012) was an American composer and conductor. Hamlisch was one of only twelve people to win Emmy, Grammy, Oscar and Tony awards. This collection of all four is referred to as an "EGOT". He is one of only two people (along with Richard Rodgers) to have won those four prizes and a Pulitzer Prize.', 'title': 'Marvin Hamlisch'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The 63rd National Hockey League All-Star Game, also known as the 2018 NHL All-Star Game, will be held at Amalie Arena in Tampa, Florida, home of the Tampa Bay Lightning on January 28, 2018. Tampa last held the NHL All Star Game in 1999. The All-Star Game will be played in lieu of NHL participation in the 2018 Olympics, as the NHL Board of Governors ruled against interrupting the season to send players to PyeongChang from 10–25 February.', 'title': '63rd National Hockey League All-Star Game'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 52nd National Hockey League All-Star Game took place on February 2, 2002, at the Staples Center in Los Angeles, California. The final score was World 8, North America 5. This was the last National Hockey League All-Star Game to have the North America vs. World All-Star format. It was also the last All-Star Game that was held in the same year as the Winter Olympics until the 2018 edition.', 'title': '52nd National Hockey League All-Star Game'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The 23rd National Hockey League All-Star Game was held in the St. Louis Arena in St. Louis, home of the St. Louis Blues, on January 20, 1970. It was the first time the All-Star Game was held at the St. Louis Arena. The East Division All-Stars defeated the West Division All-Stars 4–1. Bobby Hull was named the game's most valuable player.", 'title': '23rd National Hockey League All-Star Game'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The 47th National Hockey League All-Star Game took place on January 18, 1997, at the San Jose Arena, home of the San Jose Sharks. The final score was Eastern Conference 11, Western Conference 7. This game was originally scheduled for the 1994–95 season, but was cancelled due to the 1994–95 NHL lockout.', 'title': '47th National Hockey League All-Star Game'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Sixth National Hockey League All-Star Game took place at the Detroit Olympia, home of the Detroit Red Wings, on October 5, 1952. For the second year in a row, the format had the First and Second All-Star Teams, with additional players on each team, play each other. After the game ended in a tie for the second year in a row, the NHL decided that they would continue with the previous format of the Stanley Cup winner playing an all-star team.', 'title': '6th National Hockey League All-Star Game'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The NHL All-Star Game SuperSkills Competition, originally known as the National Hockey League All-Star Skills Competition, is an event on the night preceding the All-Star Game. Started at the 41st National Hockey League All-Star Game in Pittsburgh in 1990, the NHL uses the event to showcase the talents of its all-star participants. Events include accuracy shooting, fastest skater, Skills Challenge Relay, hardest shot, Breakaway Challenge, and an Elimination Shootout. The All-Star teams select representatives for each event, with points awarded to the winning team.', 'title': 'NHL All-Star Skills Competition'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The NBL Canada All-Star Game is an exhibition game hosted by the National Basketball League of Canada (NBL), currently matching a group of players from the Central Division against a group from the Atlantic Division. The first All-Star game took place at the Halifax Metro Centre in Halifax, Nova Scotia on April 1, 2012. In the inaugural game, the format did not take divisions into account and randomly divided players under captains Joey Haywood and Eddie Smith. As of 2014, the players are decided on the coaches' votes. No All-Star game took place for the 2014–15 NBL Canada season. The game takes place alongside multiple other competitions, together known as All-Star Weekend. These competitions include the Three-Point Long Distance Shootout and the Slam Dunk Championship. Neither event took place in 2015.", 'title': 'NBL Canada All-Star Game'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The 58th National Hockey League All-Star Game, also known as the 2011 National Hockey League All-Star Game presented by Discover, was the National Hockey League's (NHL) annual All-Star Game played on January 30, 2011. The game took place during the 2010–11 NHL season at the RBC Center in Raleigh, North Carolina, home of the Carolina Hurricanes. Originally, the Game was supposed to be hosted by the Phoenix Coyotes, but due to ownership issues, the NHL decided to move the game. After bidding for the game reopened, it was awarded to Carolina and fulfilled a nine-year-old promise made to the franchise by NHL Commissioner Gary Bettman.", 'title': '58th National Hockey League All-Star Game'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The 53rd National Hockey League All-Star Game was held during the 2002–03 NHL season, and took place at the Office Depot Center in Sunrise, Florida, the home of the Florida Panthers, on February 2, 2003. It was the first All-Star Game since the 1997 All-Star Game to use the Eastern Conference–Western Conference format.', 'title': '53rd National Hockey League All-Star Game'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'The BB&T Center (previously known as the National Car Rental Center, Office Depot Center, and BankAtlantic Center) is an indoor arena located in Sunrise, Florida. It is home to the Florida Panthers of the National Hockey League. It was completed in 1998, at a cost of US$185 million, almost entirely publicly financed, and features 70 suites and 2,623 club seats.', 'title': 'BB&amp;T Center (Sunrise, Florida)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Mary Ann Green (1964 – January 8, 2017) was an American tribal leader and politician who served as the Chairwoman of the Augustine Band of Cahuilla Indians, a federally recognized Cahuilla band of Native Americans based in Coachella, California, from 1988 until 2016. Under Green, who was first elected chairperson in 1988, the Augustine Band of Cahuilla Indians established a tribal government in 1994 and resettled their reservation, located in Coachella, in 1996. She also oversaw the development and establishment of the Augustine Casino, which opened in 2002. Through the casino, the small Augustine Band of Cahuilla Indians is now one of the largest employers in the Coachella Valley, as of 2017.', 'title': 'Mary Ann Green'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The constitutional process in Turkey begins with Sened-i İttifak in 1808 and continues today. Sened-i İttifak prepared by Alemdar Mustafa Pasha, in period of Mahmut II was signed on September 29, 1808 among Rumelian and Anatolian chief men and the Ottoman State in order to make the central authority dominant at the provinces. This document is agreed to the first "constitutional document" in the Turkish history, because for the first time in Turkish history with Sened-i İttifak in Ottoman the state power is gotten limited. Imperial Edict of Reorganization prepared by Mustafa Reshid Pasha on November 3, 1839 in period of Abdülmecit was declared. The sovereign with this imperial edict swore he was going to adapt to policies declared on imperial edict and laws to be put. Hatt-ı Hümayun that was complementary and reinforcing of this imperial edict was declared as "edict" in 1856 by Abdülmecit. Eggheads and writers growing up in the period of Tanzimat and known as The Young Ottomans began to defend constitutionalism government by being affected from Europe and they brought Abdülhamit II instead of him, by taking down Abdülaziz from throne in order to get constitutionalism declared. On December 23, 1876 it was passed to constitutionalism by being declared Kanun-i Esasî Mithat Pasha prepares. Kanun-i Esasî is amditted as a constitution according to criteria. In accordance with 113th article of Kanun-i Esasî that was the first constitution of Turkish history and consisting of 12 sections and 119 articles, the sovereign could suspend constitution on extraordinaries conditions. Abdülhamit II suspended constitution by showing why Russian wars in 1877. A result of the military insurrection in 1908, Abdülhamit II constituted the Constitution of 1876 again and so the period of Constitutionalism II began. it was made important changes on constitution in 1909 after Abdülhamit II taken down from throne after in 1909 31 March Incident happened. By these changes, Constitution of 1876 became a constitution of limited parliamentarian monarchy. With İstanbul is occupied on March 16, 1920 after Ottoman State is beat in World War I, Chamber of Deputies of the Ottoman Empire gathered for last time on March 18, 1920 and took a break from its workings. After Damad Ferid Pasha got Meclis-i Mebusan abrogated on April 11, 1920, on April 23, 1920 the first Grand National Assembly gathered in Ankara. The Assembly admitted Turkish Constitution of 1921. With changes made on law of Teşkilât-ı Esasîye that was only tender constitution of The Republic of Turkey elements such as regime, the religion, the language, the capital, president of the state were designated. because of officially not being repealed Kanun-i Esasi of 1876, Law of Teşkilât-ı Esasîye not detailed at degree to pay needs of a new state, new period Grand National Assembly of Turkey remained face to face with question to do a new constitution. New Law of Teşkilât-ı Esasîye ( Constitution of 1924) was admitted on day April 20, 1924. Constitution of 1924 is more pliant to Constitution of 1921 in the unity powers and a taken important step aimed at parliamentarin regime. Constitution of 1924 remained in effect until 1961. On May 27, 1960, a group of officers named National Union Committee confiscated management. By being founded Founder Assembly for being done a new constitution, new constitution was allowed to prepare this assembly. On July 9, 1961 referendum was performed and Constitution of 1961 by 61.5% in result of the vote was admitted. To ends of 1960s in Turkey result of political intensity events increase and these can not be obstructed Chief of Staff President and Force Commanders on 12 March 1971 forced Demirel prime minister of the period resignation. With Demiral resigns a "non-partisan" government in army support was founded and change on constitution was made. Army on 12 September 1980 because of 12 March Diplomatic Note does not give conclusions expected consfiscated management. "Founder Assembly" in order to make a constitution with law enacted on 29 June 1981 was created. This assembly that consisted of The Turkish National Security Council Consultation Assembly presented to public opinion on 7 November 1982 constitution it prepares. Constitution by 91.37% has been admitted and it has been published.', 'title': 'Constitutional process in Turkey'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Cherokee Female Seminary, (not to be confused with the first Cherokee Female Seminary), serves as the centerpiece of Northeastern State University, located in Tahlequah, Oklahoma, United States. The building was constructed to replace the original Cherokee Female Seminary that burnt to the ground Easter Sunday 1887. The Cherokee Council chose to rebuild the school on a 40 acre site north of Tahlequah, near Hendricks Spring. Two years later, on May 7, 1889, the dedication ceremonies were held in honor of the new building. The Female Seminary was owned and operated by the Cherokee Nation until March 6, 1909 when the State Legislature of Oklahoma passed an act providing for the creation and location of Northeastern State Normal School at Tahlequah, Oklahoma, and for the purchase form the Cherokee Tribal Government of the building, land, and equipment of the Cherokee Female Seminary. At the start of the next academic year, on September 14, the first classes were held at the newly created Northeastern State Normal School, now Northeastern State University.', 'title': 'Cherokee Female Seminary'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Squaxin Island Tribe (also Squaxin, Squaxon) is a Native American tribal government in western Washington state in the United States. The Squaxin Island Tribe is made up of several Lushootseed clans living along several inlets of southern Puget Sound:', 'title': 'Squaxin Island Tribe'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The Cherokee National Holiday is an annual event held each Labor Day weekend in Tahlequah, Oklahoma. The event celebrates the September 6, 1839 signing of the Constitution of the Cherokee Nation in Oklahoma after the Trail of Tears Indian removal ended.', 'title': 'Cherokee National Holiday'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The Cherokee Nation (ᏣᎳᎩᎯ ᎠᏰᎵ, pronounced "Tsalagihi Ayeli") from 1794–1907 was a legal, autonomous, tribal government in North America recognized from 1794 to 1907. Often referred to simply as ""The Nation"" by its inhabitants, it should not be confused with what is known in the 21st century also as the Cherokee Nation.', 'title': 'Cherokee Nation (1794–1907)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Cow Creek Band of Umpqua Tribe of Indians, known to the Bureau of Indian Affairs (BIA) as the Cow Creek Band of Umpqua Indians of Oregon is a federally recognized Native American tribal government based in Canyonville, Oregon, United States. The Cow Creek Band is also known as the Upper Umpqua. The tribe takes its name from Cow Creek, a tributary of the South Umpqua River.', 'title': 'Cow Creek Band of Umpqua Tribe of Indians'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Charles W. Blackwell (July 30, 1942 – January 2, 2013) was an American Chickasaw Nation diplomat and lawyer. He served as the first Ambassador of the Chickasaw Nation to the United States of America from 1995 until his death in 2013. Blackwell, who represented the Chickasaw Nation of the U.S. state of Oklahoma, was the first Ambassador of any Native American tribal government to the government of the United States.', 'title': 'Charles W. Blackwell'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Native American Venture Fund (NAVF) is a for-profit, Impact Investment Fund that partners with Native American Tribal Corporations to leverage the tribe’s economic and legal advantages in order to develop successful tribal business enterprises. These legal advantages are defined as Tribal Sovereignty which are based upon existing laws and treaties to ensure that U.S. state governments and the U.S. federal government live up to their legal obligations to the Native American Tribal Nations. NAVF's vision is to help all tribal nations become economically self-sufficient by providing access to business opportunities, capital, training and mentor-ship.", 'title': 'Native American Venture Fund'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Menominee Restoration Act, signed by President of the United States Richard Nixon on December 22, 1973, returned federally recognized sovereignty to the Menominee Indian Tribe of Wisconsin. It also restored tribal supervision over property and members, as well as federal services granted to American Indian tribes. The Act officially repealed the "Termination Act" of 1954. It also called for the creation of the Menominee Restoration Committee, which would be responsible for drafting new tribal constitutions and serve as an interim authority until an officially elected tribal government was put into place. In addition, all Menominee Indians born after the termination of the action would be added to the tribal roll.', 'title': 'Menominee Restoration Act'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Nuestra Belleza Latina 2009 is the third season of Nuestra Belleza Latina (Our Latin Beauty) premiered on March 2009. Auditions were once again held in five major US cities (Los Angeles, California; Dallas, Texas; Miami, Florida; Chicago, Illinois; and New York City, New York) and in San Juan, Puerto Rico. During the audition process, 75 young women were given passes to the semi-finals in Miami, Florida. With the twist of adding one more contestant named "La Intrusa" (Francheska Mattei). For several weeks, Francheska Mattei, a professional actress, posed as one of the contestants to know the rumors, secrets, and even gossip from the girls. The elimination process was quick, with 15 women leaving the first day, 40 on the second week, and finally 8 women were eliminated leaving the 12 finalists who will be moving into a Miami mansion where they will be living together for the rest of the competition. Each week, viewers will have a chance to vote for their favorite finalists. The three women with the least number of votes will then be in danger of being eliminated. However, two of the women in the bottom three will have the chance of being saved, one by her fellow finalists, and the other by the judges. This year they had an "Intrusa", the one that spilled the gossip about the contestants and it was Puerto Rican, Francheska Mattei.', 'title': 'Nuestra Belleza Latina 2009'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Lady and the Tramp is a 1955 American animated romantic musical comedy-drama film produced by Walt Disney and released to theaters on June 22, 1955 by Buena Vista Distribution. The 15th Disney animated feature film, it was the first animated feature filmed in the CinemaScope widescreen film process. Based on "Happy Dan, The Whistling Dog" by Ward Greene, "Lady and the Tramp" tells the story of a female American Cocker Spaniel named Lady who lives with a refined, upper-middle-class family, and a male stray mongrel called the Tramp. When the two dogs meet, they embark on many romantic adventures. A direct-to-video sequel, "", was released in 2001.', 'title': 'Lady and the Tramp'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Expeditie Robinson: 2006, was the eighth Dutch/Belgian version of the Swedish show Expedition Robinson, or Survivor as it is referred to in some countries. This season began airing on August 28, 2006 and concluded on November 20, 2006. The major twist this season was that the tribes were initially divided up by gender with one "All-Star" contestant joining each tribe. These two All-Stars were, Klaar Lippe and Robin Ibens. Though the main twist may have seemed like a repeat of twists that occurred in previous seasons, unlike previous seasons with a similar twist this season male contestants were from Belgium and all females from the Netherlands. While the All-Star contestants weren\'t eligible to win, they could vote and following a tribal swap in episode 4, they could give any contestant on their tribe immunity at tribal council. Following the merge in episode 8, the twist that was "Losers Island", was introduced to the game. After a contestant was eliminated they would be sent to Losers island where they would wait until there were only two contestants left in the game at which point the six contestants on the island would vote for one of their own to return. When it came time to vote for a winner, the public, instead of a jury decided the winner. In the end, it was Olga Urashova who returned from Losers island in the final three, who won the season over Lenny Janssen with a public vote of 52% to Lenny\'s 48%.', 'title': 'Expeditie Robinson 2006'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Nuntita Khampiranon (Thai: นันทิตา ฆัมภิรานนท์ ; rtgs:\xa0"Nanthita Khamphiranon" ; born December 20, 1983), or nickname Art (อาร์ต), stage name Bell (เบลล์) and usually known as Bell Nuntita, is a Thai transgender actress, singer, entertainer, and radio DJ. Nuntita was part of a TV show called "Venus Flytrap Search for the Missing Puzzle" in 2007. As one of twelve contestants, she competed to take the place of two former cast members. Nuntita and another contestant named Mew won the competition and became part of the Kathoey band "Venus Flytrap". She became popular after a performance during her audition on "Thailand\'s Got Talent" and became a YouTube hit when she first performed singing as a girl, and the crowd was amazed when she switched to a masculine voice.', 'title': 'Bell Nuntita'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Nicholas James Donnelly (born 17 May 1988) is a British filmmaker and music video producer who first gained exposure when directing/producing the music video Game Over Female Takeover, an independent release that featured many of the leading female urban artists in England on one video. These artists included Lady leshurr, Mz Bratt, Ruff Diamondz, Cherri Voncelle and Amplify Dot The video served as the official remix to the record Game Over (Tinchy Stryder song)', 'title': 'Nick Donnelly'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Donkey Kong (Japanese: ドンキーコング , Hepburn: Donkī Kongu ) is an arcade game released by Nintendo in 1981. An early example of the platform game genre, the gameplay focuses on maneuvering the main character across a series of platforms while dodging and jumping over obstacles. In the game, Mario (originally named Mr. Video and then Jumpman) must rescue a damsel in distress named Pauline (originally named Lady), from a giant ape named Donkey Kong. The hero and ape later became two of Nintendo\'s most popular and recognizable characters. "Donkey Kong" is one of the most important titles from the golden age of arcade video games, and is one of the most popular arcade games of all time.', 'title': 'Donkey Kong (video game)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Shin Su-ran (Hangul: 신수란), also known by her stage names Elena (Hangul: 엘에나) and Baily Shoo (Hangul: 베일리 슈), and better known by the mononym Suran (Hangul: 수란), is a South Korean singer-songwriter and record producer. She debuted as part of the duo, Lodia, on July 9, 2014, with the single "I Got A Feeling". In 2017, she has also appeared on MBC\'s "King of Mask Singer" (episodes 93–94) as a contestant named "Skip to the End, Hello".', 'title': 'Suran (singer)'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'The Rap Game is an American reality television series. The series premiered on January 1, 2016, on Lifetime. The winners of seasons 1, 2, and 3, respectively, were Miss Mulatto, Mani, and Nova.', 'title': 'The Rap Game'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Wonky is the eight studio album by Orbital, released on their own ACP label (via Warner Music Group/Alternative Distribution Alliance) in the UK on 2 April 2012, and exclusively through iTunes in the USA and Canada on 17 April 2012. The album is their first since the "Blue Album" in 2004 and the first since they reformed in 2008. It features vocals from Zola Jesus and Lady Leshurr. The album was taken off of Spotify and iTunes in the United States for unknown reasons. There are some songs you cannot find at all in their original versions, like Beelzedub or Distractions.', 'title': 'Wonky (album)'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Melesha O\'Garro (born 15 December 1988), known professionally as Lady Leshurr ( ), is an English rapper, singer, and producer. She is best known for her "Queen\'s Speech" series of freestyles, the fourth of which went viral in 2016. " The Rap Game" season 2 competitor Nia Kay stated that Leshurr was one of her influences due to her uniqueness and rap skill. Her subsequent freestyle, "Queen\'s Speech 5", was called "brilliant" and "2015\'s crowning freestyle" by Spin.', 'title': 'Lady Leshurr'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The California Birth Index (CABI) is a database compiled by the California Office of Health Information and Research. The index contains birth records of all registered births in California between 1905 and 1995. Each record is an abstract of a person's birth certificate, including date of birth, full name, county of birth, gender, and mother's maiden name. People who have been adopted are sometimes listed by their birth name, sometimes listed by their adopted name, sometimes by both and sometimes not listed at all. The CABI is considered a valuable genealogy tool but is also criticized for privacy issues. California began statewide civil registration of births on July 1, 1905. Earlier birth records may exist in the county where the birth took place or at the church where a baptism took place.", 'title': 'California Birth Index'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Hwarang: The Poet Warrior Youth () is a South Korean television series starring Park Seo-joon, Go A-ra, and Park Hyung-sik. It evolves around an elite group of young men called "Hwarang" who discover their passions, love and friendship in the turmoil of the Silla Kingdom (57 B.C. - A.D. 935). The series aired every Monday and Tuesday at 22:00 (KST) on KBS2, from December 19, 2016 to February 21, 2017.', 'title': 'Hwarang: The Poet Warrior Youth'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Hwarang, also known as Flowering Knights, were an elite warrior group of male youth in Silla, an ancient Korean kingdom that lasted until the 10th century AD. There were educational institutions as well as social clubs where members gathered for all aspects of study, originally for arts and culture as well as religious teachings stemming mainly from Buddhism. Chinese sources referred only to the physical beauty of the "Flower Youths". Originally, the hwarang were known for their use of make-up and cosmetic decorations and accessories. The history of the hwarang was not widely known until after the liberation of 1945, after which the hwarang became elevated to a symbolic importance.', 'title': 'Hwarang'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Park Seo-joon (born Park Yong-gyu) is a South Korean actor. He is best known for his roles in the television dramas "Kill Me, Heal Me" (2015), "She Was Pretty" (2015), "" (2016-2017) and "Fight for My Way" (2017).', 'title': 'Park Seo-joon'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'José Gutiérrez Hernández (born March 1, 1973), better known under the ring name Último Guerrero (Spanish for "Last Warrior"), is a Mexican "Luchador" , or professional wrestler, currently working for "Consejo Mundial de Lucha Libre" (CMLL), where he is also part of the booking committee. He is not related to the "lucha libre" legend Gory Guerrero or any of his children, "Guerrero" in this case is the Spanish word for warrior and not the surname of the character. On September 19, 2014, Último Guerrero lost a "Lucha de Apuestas" match to Atlantis, after which he was forced to unmask and reveal his birth name.', 'title': 'Último Guerrero'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Gerrie is Dutch and Afrikaans unisex given name. It is a diminutive of Ger, itself short for Gerard. As a birth name in the Netherlands, it is primarily feminine, peaking in popularities around 1950, but the name is more common as a nickname for men with the birth name Gerard(us) or Gerrit.', 'title': 'Gerrie (given name)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Mental As Anything are an Australian new wave/pop-rock band that formed in Sydney in 1976. Its most popular line-up (which lasted from 1977-1999) was Martin Plaza (birth name Martin Murphy) on vocals and guitar; Reg Mombassa (birth name Chris O\'Doherty) on lead guitar and vocals; his brother Peter "Yoga Dog" O\'Doherty on bass guitar and vocals; Wayne de Lisle (birth name David Twohill) on drums; and Andrew "Greedy" Smith on vocals, keyboards and harmonica. Their original hit songs were generated by Mombassa, O\'Doherty, Plaza and Smith, either individually or collectively; they also hit the Australian charts with covers of songs by Roy Orbison, Elvis Presley and Chuck Berry.', 'title': 'Mental As Anything'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Emmanuel Agapito Flores Lacaba (December 10, 1948\xa0– March 18, 1976), popularly known as Eman Lacaba, was a Filipino writer, poet, essayist, playwright, fictionist, scriptwriter, songwriter and activist and he is considered as the only poet warrior of the Philippines.', 'title': 'Emmanuel F. Lacaba'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Master Po Ping (birth name: Lotus Shan) is the title character and the protagonist of the "Kung Fu Panda" franchise. He is a young anthropomorphic giant panda in his 20s, who is improbably chosen as the Dragon Warrior, champion of the Valley of Peace in the first film. He\'s the adoptive son of Mr. Ping, and is one of Master Shifu\'s students. Po is also the prophesied Dragon Warrior, as well as the warrior of black and white. In "", Po\'s revealed to have the ability to be able to learn kung fu at a glance.', 'title': 'Po (Kung Fu Panda)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Elf is the first album by Ronnie James Dio\'s blues rock band called Elf. Produced by Ian Paice and Roger Glover of Deep Purple, the record was released in 1972. In this album, Dio is listed by his birth name Ronald Padavona. Though Dio had used "Padavona" for songwriting credits on earlier singles, Dio explained in an interview in 1994 that he used his birth name on this album as a tribute to his parents so that they could see their family name on an album at least once.', 'title': 'Elf (album)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': '"My Feet Keep Dancing" is the third single from Chic\'s third studio album "Risqué". It features a co-lead vocal by Luci Martin and Bernard Edwards and a tap dance solo by Fayard Nicholas (of the Nicholas Brothers), Eugene Jackson (of Our Gang), and Sammy Warren.', 'title': 'My Feet Keep Dancing'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Guy and Madeline on a Park Bench is a 2009 American black-and-white jazz musical film directed, written, produced, shot, and co-edited by Damien Chazelle, that recasts the MGM musical tradition in a gritty, vérité style. It stars Jason Palmer, Desiree Garcia and Sandha Khin. The film features a unique mixture of live jazz performances and choreographed tap dancing, as well as several more traditional musical numbers.', 'title': 'Guy and Madeline on a Park Bench'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Reggio “The Hoofer” McLaughlin, tap dancer, instructor and choreographer started his artistic career in the subways of Chicago, where he had developed his unique style of tap dance hoofing, characterized by raw form of African American Tap. The combination of African foot stomping, Irish step and his lengthy experience contributes to the world of tap dancing.', 'title': 'Reginald McLaughlin'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'National Tap Dance Day falls on May 25th every year and is a celebration of tap dancing as an American art form. The idea of National Tap Dance Day was first presented to U.S. Congress on February 7, 1989 and was signed into American law by President George H.W. Bush on November 8, 2004. The one-time official observance was on May 25, 1989. Tap Dance Day is also celebrated in other countries, particularly Japan, Australia, India and Iceland. Tap Dance Day is celebrated online, with over 3,000 mentions on social media in 2016.', 'title': 'National Tap Dance Day'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': '"Last Tap Dance in Springfield" is the twentieth episode of the eleventh season of the American animated sitcom "The Simpsons". It originally aired on the Fox network in the United States on May 7, 2000. In the episode, Lisa decides to sign up for tap dancing lessons after being inspired by a film about a girl who enters a tango contest and wins. Meanwhile, Bart and Milhouse hide out at the mall to escape going to summer camp. "Last Tap Dance in Springfield" was written by Julie Thacker, who based it on her own experiences with dance classes. The episode has received mixed reception from critics.', 'title': 'Last Tap Dance in Springfield'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Tap City, the New York City Tap Festival, was launched in 2001 in New York City. Held annually for approximately one week each summer, the festival features tap dancing classes, choreography residencies, panels, screenings, and performances as well as awards ceremonies, concert performances, and Tap it Out, a free, public, outdoor event performed in Times Square by a chorus of dancers. The goal of the Festival is to establish a "higher level of understanding and examination of tap’s storied history and development.”', 'title': 'Tap City: the New York City Tap Festival'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Jack Wiggins was an African-American entertainer of the early twentieth century, now remembered primarily for his elegant style in tap dancing. Wiggins worked as a performer at the Hoofers Club on "Swing Street" in Harlem, New York, where he inspired Laurence Donald "Baby Laurence" Jackson (later a member of the Tap Dance Hall of Fame). Wiggins also influenced Fayard and Harold Nicholas of the famous Nicholas Brothers tap duo. Wiggins was recognized as a master soloist in the "Class Act" style of tap dancing. A signature dance of Wiggins\' was the "tango twist."', 'title': 'Jack Wiggins'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Charles "Chuck" Green (November 6, 1919 – March 7, 1997) was an American tap dancer. Green was born in Fitzgerald, Georgia. He would stick bottle caps on his bare feet as a child and tap dance on the sidewalk for money. He won third place in a dance contest in 1925 in which Noble Sissle was the bandleader. Soon Green would be touring the South tap dancing.', 'title': 'Chuck Green'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Glamour Puss Studios Tap Dancing Academy was established in 1997 and is a Melbourne tap school specifically for adults and specialising in adult beginner tap dance. More than 300 students attend classes held at either of the two 60s styled studios located in St Kilda, Victoria and Richmond, Victoria.', 'title': 'Glamour Puss Studios Tap Dancing Academy'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Fayard Antonio Nicholas (October 20, 1914 – January 24, 2006) was an American choreographer, dancer and actor. He and his younger brother Harold Nicholas made up the Nicholas Brothers tap-dance duo, who starred in the MGM musicals "An All-Colored Vaudeville Show" (1935), "Stormy Weather" (1943), "The Pirate" (1948), and "Hard Four" (2007). The Nicholas brothers also starred in the 20th Century-Fox musicals "Down Argentine Way" (1940), "Sun Valley Serenade" (1941), and "Orchestra Wives" (1942).', 'title': 'Fayard Nicholas'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "July 5, 1962 Stadium (English: 5 July 1962 Stadium , Arabic: ملعب 5 جويلية 1962\u200e \u200e ), (the name refers to 5 July 1962, the day Algeria declared independence from France), also known as El Djezair Stadium (Arabic: ملعب 5 جويلية بالجزائر\u200e \u200e ), is a football and athletics stadium located in Algiers, Algeria. The stadium was inaugurated in 1972 with a capacity of 95,000. It served as the main stadium of the 1975 Mediterranean Games, the 1978 All-Africa Games, the 2004 Pan Arab Games, and the 2007 All-Africa Games. The stadium was one of two venues of the 1990 African Cup of Nations (the other venue was the Stade 19 Mai 1956 in Annaba). It hosted 9 matches of the tournament, including the final match, which had a second record attendance of 105,302 spectators. In the final match, the home team Algeria defeated Nigeria 1-0 to win the tournament. The record attendance is of 110,000 spectators in the frendly match between Algeria and Serbia on 3 March 2010. It also hosted the 2000 African Championships in Athletics. After a formal compliance with current safety standards in 1999, the stadium was reduced to an 80,200 capacity, and following a new phase of renovation in 2003, the stadium's capacity has been reduced further to its current all-seater capacity of 64,000. The future capacity will be 80,000 with possible further renovations.", 'title': 'July 5, 1962 Stadium'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Pokémon Stadium 2, known as Pocket Monsters\' Stadium Kin Gin (ポケモンスタジアム金銀 , Pokemon Sutajiamu Kin Gin , lit.: Pokémon Stadium Gold Silver) in Japan, is a strategy video game developed by Nintendo EAD and published by Nintendo for the Nintendo 64. It features all 251 Pokémon from the first and second generations of the franchise. It was released on December 14, 2000, in Japan, March 26, 2001, in North America, and October 10, 2001, in Europe. In Western regions it was titled "Pokémon Stadium 2", as it was the second "Stadium" game to be released outside Japan, in which it was the third game in the series. It supports Dolby Surround sound.', 'title': 'Pokémon Stadium 2'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Benedetti–Wehrli Stadium is a stadium in Naperville, Illinois. It is primary used for American football and soccer. The stadium hosted the 2000 NCAA Division III Men\'s Outdoor Track and Field Championship. The stadium opened in 1999 for North Central College and was used by the Chicago Fire in 2002 and 2003, when it was known as "Cardinal Stadium". Benedetti–Wehrli Stadium is named after two North Central College Alumni/Donors: Albert Benedetti and Richard Wehrli. Benedetti-Wehrli also hosts the two highly hyped football games of Naperville Central High School - Naperville North High School and Waubonsie Valley High School-Neuqua Valley High School. The stadium also serves as host to a competitive drum corps show hosted by The Cavaliers Drum and Bugle Corps of Rosemont, Ill., each summer. The stadium has a capacity of 5,500. The stadium served as a venue for the quarter finals of the 2000 Lamar Hunt U.S. Open Cup.', 'title': 'Benedetti–Wehrli Stadium'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'La Más Perfecta Colección is the third greatest hits compilation by Spanish recording artist Mónica Naranjo released on December 6, 2011 through Sony. The album includes most of her hits from her five studio albums and "Enamorada de Ti", which was included on her compilation "Colección Privada" (2005), and also includes one new track, "Emperatriz de Mis Sueños", which was used as the theme song for the Mexican telenovela "Emperatriz". The album also includes a bonus DVD with music videos and live performances from her hits.', 'title': 'La Más Perfecta Colección'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Bloomfield Road is a 17,338-capacity all-seater football stadium in the English town of Blackpool, Lancashire, in an area known as South Shore. It has been the permanent home of Blackpool F.C. since 1901, and was the 68th ground to host a Football League game. The stadium is named after the road on which the main entrance used to stand. The stadium has been in a process of redevelopment since 2000. June of that year saw the demolition of the Spion Kop at the north end of the ground; an all-seated stand has now replaced it. The rebuilding of the West Stand was completed in August 2002. In March 2010, the South Stand, whose original structure was pulled down in 2003, was opened by Jimmy Armfield, the former Blackpool player for whom the stand is named. A temporary East Stand opened on 28 August 2010 with a capacity of 5,120 seats, initially increasing capacity to 16,220 with further hospitality seating in the South Stand to be installed later in the year. Bloomfield Road is ranked 52 in the list of English football stadiums by capacity.', 'title': 'Bloomfield Road'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Amsterdam Arena (] , officially stylised as Amsterdam ArenA) is a stadium in Amsterdam, Netherlands. It is the largest stadium in the country, built from 1993 to 1996 at a cost of €140\xa0million, and officially opened on 14 August 1996. It has been used for association football, American football, concerts, and other events. The stadium has a retractable roof combined with a grass surface. It has a capacity of 54,033 people during football matches, and of 68,000 people during concerts if a centre-stage setup is used (the stage in the middle of the pitch); for end-stage concerts, the capacity is 50,000, and for concerts for which the stage is located in the east side of the stadium, the capacity is 35,000. It held UEFA five-star stadium status, which was superseded by a new system of classification. From 25 October 2017, the stadium will be known as the Johan Cruijff Arena.', 'title': 'Amsterdam Arena'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Palacio de Deportes de la Comunidad de Madrid (English: "Community of Madrid Sports Centre"), since November 2016 called WiZink Center for sponsorship reasons, is an indoor sporting arena located in Madrid, Spain. Its capacity is 15,000 people for basketball matches and 15,500 for concerts (with standing public ramp).', 'title': 'Palacio de Deportes de la Comunidad de Madrid'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Colección Privada: Grandes Éxitos & Remixes is the second greatest hits compilation by Spanish recording artist Mónica Naranjo released on April 27, 2005. The compilation was released in two different formats, the 2CD+DVD edition, containing the greatest hits album with a remixes album and a bonus disc with music videos including the previously unreleased video "Perra Enamorada", and the 3CD+DVD Lujo-Box Set containing her "Tour Minage", filmed on October 10, 2000, in Palacio de los Deportes, in Madrid, Spain. The album includes one new track, "Enamorada de Tí", which was released on April 18, 2005.', 'title': 'Colección Privada'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Griswold Stadium is an American football and soccer stadium which serves as the home of the Lewis & Clark Pioneers football and soccer teams. It is located in Portland, Oregon, featuring an AstroTurf field and a seating capacity of 3,500. It has hosted track and field events as well. The land that the stadium sits on was forested before it was built. In 1952, Graham Griswold donated US$25,000 and lumber towards the erection of a new football stadium, complete with grandstands. The first game that occurred at the stadium took place on October\xa010, 1953, with Lewis & Clark against the Linfield Wildcats football team. It was officially named "Griswold Stadium" in 1954 after the benefactor of the construction project. In 2003, lights were installed at Griswold Stadium allowing for night games. The AstroTurf (GameDay Grass 3D brand) playing surface was purchased for the field in 2010. The school dedicated the field to former player and coach Fred Wilson that year. Located in the stadium is the Eldon Fix Track which was last resurfaced in 1999. In 2012, the grandstands were rebuilt to allow for 3,000 general admission seats and 500 VIP seats. In 1955, the Oregon state high school cross country championships took place at Griswold Stadium.', 'title': 'Griswold Stadium'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'El Dorado Gate (エルドラドゲートシリーズ ) is a series of Japan-exclusive role-playing video games for the Sega Dreamcast. Its seven volumes were released on a bi-monthly basis in Japan from October 10, 2000 through October 10, 2001.', 'title': 'El Dorado Gate'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'God\'s Gift to Women (1931) is an American Pre-Code romantic musical comedy film by Warner Brothers. The film starred Frank Fay, Charles Winninger, Laura LaPlante, Louise Brooks and Joan Blondell. The film was based on the play called "The Devil Was Sick" by Jane Hinton, and was originally completed as a musical film. Due to audience distaste for musicals, however, all the songs were cut in American prints. The complete film was released intact in other countries, where there was no such decline in popularity.', 'title': "God's Gift to Women"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Show Boat is a 1936 romantic musical film directed by James Whale, based on the musical of the same name by Jerome Kern and Oscar Hammerstein II, which in turn was adapted from the novel of the same name by Edna Ferber.', 'title': 'Show Boat (1936 film)'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "Once is a 2007 Irish romantic musical film written and directed by John Carney. The film stars Glen Hansard and Markéta Irglová as two struggling musicians in Dublin, Ireland. Hansard and Irglová had previously performed music as the Swell Season, and composed and performed the film's original songs.", 'title': 'Once (film)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Kings is a 2007 Irish film written & directed by Tom Collins and based on Jimmy Murphy\'s play "The Kings of the Kilburn High Road". The film is bilingual, having both Irish and English dialogues. It premiered at the Taormina Film Festival (Italy) in June 2007, and was selected as Ireland\'s official entry for the 2008 Academy Awards in the best foreign-language film category. The film tells the story of a group of Irish friends who, after emigrating to England 30 years previously, meet for the funeral of a friend. In 2008, the Irish postal service, An Post, issued a series of stamps honouring the Irish film industry. Colm Meaney, as Joe Mullan, was featured on the 55 cent stamp.', 'title': 'Kings (2007 film)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Cat and the Fiddle is a 1934 American Pre-Code romantic musical film directed by William K. Howard based on the hit 1931 Broadway musical of the same name by Jerome Kern and Otto A. Harbach, about a romance between a struggling composer and an American singer. The film stars Ramon Novarro and Jeanette MacDonald in her MGM debut.', 'title': 'The Cat and the Fiddle (film)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Adaraneeya Kathawak (English: "A Melody Of Love" ) is a 2016 Sri Lankan Sinhala romantic musical film, directed and co-produced by Priyantha Colombage. It was released on 10 June 2016. Starring Hemal Ranasinghe, Udari Warnakulasooriya, Bimal Jayakody and Aruni Rajapaksha in the lead roles. The film has influenced by romantic musical Bollywood film "Aashiqui 2".', 'title': 'Adaraneeya Kathawak'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'Once is a musical based on the 2007 film of the same name by John Carney. Like the film, music and lyrics were by Glen Hansard and Markéta Irglová, including the Academy Award-winning "Falling Slowly". The book for the musical was written by Enda Walsh. The musical premiered at the New York Theatre Workshop in 2011, before transferring to Broadway in 2012. The production received eleven 2012 Tony Award nominations, and won eight including Best Musical, Best Actor and Best Book. The musical also won the 2012 Drama Desk Award for Outstanding Musical and the 2013 Grammy Award for Best Musical Theater Album. It has since spawned a London production, with a North American Tour which started on 1 October 2013.', 'title': 'Once (musical)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Borstal Boy is a 2000 British/Irish romantic drama film adaptation of the Brendan Behan autobiographical novel of the same name. The film is written and directed by Irish playwright Peter Sheridan.', 'title': 'Borstal Boy (film)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Ratha Sapthami (ರಥಸಪ್ತಮಿ) is a 1986 Indian-Kannada romantic musical film directed by M. S. Rajashekar and produced by S. A. Govindaraj. The film starred Shivarajkumar in his second venture after "Anand" and debutant actress Asha Rani and playwrighter Parvathavani in the lead roles. The film had a musical score composed by Upendra Kumar while the lyrics, screenplay and dialogues were written by Chi. Udaya Shankar. P. Vasu was co-writer of this movie. The movie is based on Kannada novel of same name by Vidyullatha Sasanoor.', 'title': 'Ratha Sapthami'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'South Pacific is a 1958 American romantic musical film based on the Rodgers and Hammerstein musical "South Pacific", which in turn based on James A. Michener\'s short-story collection "Tales of the South Pacific". The film, directed by Joshua Logan, starred Rossano Brazzi, Mitzi Gaynor, John Kerr and Ray Walston in the leading roles with Juanita Hall as Bloody Mary, the part that she had played in the original stage production. The film was nominated for three Academy Awards, winning the Academy Award for Best Sound for Fred Hynes.', 'title': 'South Pacific (1958 film)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': "The Nike Hoop Summit is an international men's basketball all-star game sponsored by Nike, held once a year since 1995, which features the USA Basketball Men's Junior Select Team against a World Select Team of international players. The players demonstrate their skills and hope to attract attention from either NBA scouts or colleges. A number of current NBA players have participated in this event in the past, including Kevin Garnett, Derrick Rose, Kevin Durant, also John Wall for the U.S.A. team, and Dirk Nowitzki, Tony Parker, Nicolas Batum, Serge Ibaka, Enes Kanter, and Patrick Mills for the World Select team. In the 2010 edition of the event, Enes Kanter scored 34 points and surpassed the event's record of 33 points set by Dirk Nowitzki in 1998. Bismack Biyombo recorded the first triple-double in Hoop Summit history in 2011 with 12 points, 11 rebounds, and 10 blocks. In 2012, Shabazz Muhammad scored 35 points to break Enes Kanter's Hoop Summit scoring record.", 'title': 'Nike Hoop Summit'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Seth Adham Curry (born August 23, 1990) is an American professional basketball player for the Dallas Mavericks of the National Basketball Association (NBA). A native of Charlotte, North Carolina, Curry played collegiately for one year at Liberty University before transferring to Duke. He is the son of former NBA player Dell Curry and the younger brother of current NBA player Stephen Curry.', 'title': 'Seth Curry'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Terrance Eugene Ferguson (born May 17, 1998) is an American professional basketball player for the Oklahoma City Thunder of the National Basketball Association (NBA). He completed high school at Advanced Preparatory International in Dallas, Texas, where he was a top-20 player in the Class of 2016. Ferguson made separate commitments to both Alabama and Arizona before deciding to skip college and play overseas in 2016–17. Ferguson is a three-time gold medalist with Team USA, and in 2016, he participated in the McDonald's All-American Game and the Nike Hoop Summit, winning the MVP award at the latter.", 'title': 'Terrance Ferguson'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Dirk Werner Nowitzki (] ) (born June 19, 1978) is a German professional basketball player for the Dallas Mavericks of the National Basketball Association (NBA). An alumnus of Röntgen Gymnasium and the DJK Würzburg basketball club, Nowitzki was chosen as the ninth pick in the 1998 NBA draft by the Milwaukee Bucks and immediately traded to the Mavericks, where he has played since. Listed at 7 ft , Nowitzki is considered to be one of the greatest power forwards of all time.', 'title': 'Dirk Nowitzki'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Austin James Rivers (born August 1, 1992) is an American professional basketball player for the Los Angeles Clippers of the National Basketball Association (NBA). Rivers led Winter Park High School to back-to-back Florida 6A state championships in 2010 and 2011. He also played in the 2011 Nike Hoop Summit for the Team USA, and was a McDonald's All-American. He was one of the top rated high school basketball players in the class of 2011, being rated as high as No. 1 by Rivals.com. On September 30, 2010, Rivers committed to Duke University. Rivers gained national recognition after making a game winning 3-pointer against Duke rival North Carolina in 2012. He was drafted with the 10th pick in the NBA draft by the New Orleans Hornets (now Pelicans), playing three seasons there before being traded to the Clippers.", 'title': 'Austin Rivers'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The 2010–11 Dallas Mavericks season was the 31st season of the franchise in the National Basketball Association (NBA). The Mavericks won the NBA Championship after defeating the Miami Heat in 6 games in the 2011 NBA Finals. The Mavs playoff run came with a 6-game first round series against the Portland Trail Blazers, a series in which the Mavericks blew a 23-point lead in Game 4, but still won the series. In the conference semi-finals, the Mavericks run was motivated with a sweep of the champions of the previous two seasons, the Los Angeles Lakers. The series against the Lakers also became the birth of the Mavericks Royal Blue-Out games in the AAC, with almost all fans wearing T-shirts that read "The Time is Now". In the Western Conference Finals against the Oklahoma City Thunder, the Mavericks won the last 3 games winning by 4th quarter comebacks, to win their second Western Conference Championship, and a trip to the NBA Finals for the first time since 2006, with a rematch against the Heat. Following a disappointing Game 1, the Mavericks pulled the biggest comeback in NBA Finals history in Game 2 to even the series at 1 game each. After a loss in Game 3, the Mavericks won the last two games in Dallas to take a 3–2 series lead heading to Game 6 in Miami. The Mavericks won their first NBA Championship in Game 6 to clinch the first major sports championship in the Dallas-Fort Worth area since the Dallas Stars in 1999, and the first title in Mavericks franchise history. The Mavericks are the third team to win an NBA title in the state of Texas, joining the Houston Rockets and San Antonio Spurs. The Mavericks are also the third team to win a major sports championship in the Dallas-Fort Worth area, joining the Dallas Cowboys\' five Super Bowl titles and the Dallas Stars\' only Stanley Cup, leaving the Texas Rangers as the only team to not win a major sports title in the area, as they have not won the World Series. The Mavericks championship parade was held on June 16, 2011 in downtown Dallas.', 'title': '2010–11 Dallas Mavericks season'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Tyus Robert Jones (born May 10, 1996) is an American professional basketball player for the Minnesota Timberwolves of the National Basketball Association (NBA). He played college basketball for the Duke Blue Devils in his freshman season as part of the 2014–15 National Championship team. He was ranked among the top 10 players in the national high school class of 2014 by Rivals.com, Scout.com and ESPN. He was a Minnesota State High School League (MSHSL) Class 4A state champion, three-time Minnesota Associated Press Boys Basketball Player of the Year and three-time Minnesota Boys Basketball Gatorade Player of the Year for Apple Valley High School. He played in the 2014 McDonald's All-American Boys Game, 2014 Jordan Brand Classic and the 2014 Nike Hoop Summit. He won the skills competition at the 2014 McDonald's All-American Game and posted the only double-double in the 2014 Jordan Brand Classic.", 'title': 'Tyus Jones'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The 1980 NBA Expansion Draft was the seventh expansion draft of the National Basketball Association (NBA). The draft was held on May 28, 1980, so that the newly founded Dallas Mavericks could acquire players for the upcoming 1980–81 season. Dallas had been awarded the expansion team on February 3, 1980. In an NBA expansion draft, new NBA teams are allowed to acquire players from the previously established teams in the league. Not all players on a given team are available during an expansion draft, since each team can protect a certain number of players from being selected. In this draft, each of the twenty-two other NBA teams had protected eight players from their roster and the Mavericks selected twenty-two unprotected players, one from each team.', 'title': '1980 NBA Expansion Draft'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The 2011 NBA Finals was the championship series of the National Basketball Association (NBA)'s 2010–11 season, and the conclusion of the season's playoffs. The Western Conference champion Dallas Mavericks defeated the Eastern Conference champion Miami Heat 4 games to 2 to win their first NBA championship. Dallas became the last NBA team from Texas to win its first title, after the Houston Rockets won back-to-back titles in and , and the San Antonio Spurs won four NBA championships in , , and , and a fifth one subsequently in ; all three Texas NBA teams have now won at least one NBA championship. It was also the first time in four years that the Los Angeles Lakers did not make the Finals, having been swept in the Western Conference semifinals by the eventual champion Dallas Mavericks.", 'title': '2011 NBA Finals'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Keijuro Matsui (popularly known as KJ) (born October 16, 1985) was a guard for the Columbia Lions basketball team at Columbia University. He is the first Japanese native basketball player in NCAA Division I history. Matsui also played in the 2005 Nike Hoop Summit for the World Select Team, only the second Japanese to do so. In the summit he scored seven points in 11 minutes.', 'title': 'Keijuro Matsui'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Matthew A. Trieber, known as Matt Trieber, is an American politician from Bellows Falls, Vermont. A member of the Democratic Party, he is also a member of the Vermont House of Representatives, representing the Windham-3 district. He was appointed to the legislature by Governor Peter Shumlin in January 2011.', 'title': 'Matt Trieber'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The 2014 Vermont gubernatorial election took place on November 4, 2014, to elect the Governor of Vermont, concurrently with elections to the United States Senate in other states and elections to the United States House of Representatives and various state and local elections. Incumbent Democratic Governor Peter Shumlin ran for re-election to a third term in office against Republican businessman Scott Milne, Libertarian businessman Dan Feliciano and several other minor party and independent candidates.', 'title': 'Vermont gubernatorial election, 2014'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Beth Robinson (born March 6, 1965) is an American lawyer and judge from Vermont who serves on the Vermont Supreme Court. Her nomination, made by Governor Peter Shumlin in October 2011, was confirmed by a unanimous vote of the Vermont Senate on February 7, 2012.', 'title': 'Beth Robinson'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Brookfield is a town in Orange County, Vermont, United States. It was created by Vermont charter on August 5, 1781. The population was 1,292 at the 2010 census. Brookfield is best known for its floating bridge which spans Sunset Lake buoyed by pontoons. The bridge, which is the only floating bridge east of the Mississippi River, was originally built in 1820 by Luther Adams and his neighbors. Sunset Lake is also the site of an annual ice harvesting festival. Brookfield boasts that it has Vermont's oldest continually operating library dating back to 1791. In 2006, Brookfield was one of the first American towns to have its citizens pass a resolution endorsing the impeachment of President George W. Bush. As of September 2010, the floating bridge was closed for repairs. Work began in 2014, and was completed May 2015. There was a celebration from May 23 – May 24, 2015, to memorialize the event. Governor Peter Shumlin attended, and cadets from Norwich University provided traffic control.", 'title': 'Brookfield, Vermont'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Helen Riehle is an American politician from the state of Vermont who served as a U.S. Republican Party member of the Vermont Senate, representing all of Chittenden County except for the town of Colchester. She is chair of the South Burlington City Council and resides in that city. Having previously served in both the State House and Senate, she was appointed by Governor Peter Shumlin in March 2016 to succeed Diane Snelling, who had earlier resigned.', 'title': 'Helen Riehle'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The 2012 Vermont gubernatorial election took place on November 6, 2012, to elect the Governor of Vermont. Incumbent governor Peter Shumlin was successful in his re-election bid.', 'title': 'Vermont gubernatorial election, 2012'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Point ("Independent Radio, The Point") is a radio network operating in the state of Vermont. The station first signed on as a single frequency local Montpelier station (WNCS) in 1977. It was started by Jeb Spaulding who is the current Chancellor of the Vermont State Colleges and former State Treasurer of Vermont and Secretary of Administration under Vermont Governor Peter Shumlin. Although at that time there was no designated Adult Album Alternative format, The Point\'s programming format has been solidly Adult Album Alternative/Progressive for its entire history.', 'title': 'The Point (radio network)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Deborah "Deb" Markowitz is a Visiting Professor of Environmental Policy and Leadership at the University of Vermont Rubenstein School of Environment and Natural Resources. She served from 2011-2017 as the Secretary of the Vermont Agency of Natural Resources. She was appointed by Vermont Governor Peter Shumlin. Prior to this, Markowitz was elected six times to serve as the Secretary of State of Vermont. Although she is a member of the Democratic Party, she won the nomination of both the Republican and Democratic Parties in two of her races.', 'title': 'Deborah Markowitz'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The State of Marriage is a 2015 documentary film about the origins of the marriage equality movement, focusing on the decades of grassroots advocacy by lawyers Mary Bonauto, Susan Murray, and Beth Robinson and the 1999 Vermont Supreme Court case "Baker v. Vermont". The film had its world premiere at the 2015 Provincetown International Film Festival on 18 June 2015. It is written and directed by Jeff Kaufman, and produced by Kaufman and Marcia Ross. Funding for the film\'s post-production and editing work was partially raised through a successful Indiegogo crowdfunding campaign.', 'title': 'The State of Marriage'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'George B. "Jeb" Spaulding (born December 28, 1952 in Manchester, Massachusetts) is the current chancellor of the Vermont State Colleges. He previously served as Vermont State Treasurer and as Governor Peter Shumlin\'s secretary of administration.', 'title': 'Jeb Spaulding'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Grange Hall in Somerset Township, Jackson County, Illinois, is the historic meeting place of Somerset Township\'s chapter of The Grange. Built in 1912, the building was Somerset Grange #1553\'s second meeting hall; the first building was built in 1876 and burned down in 1909. The red brick building was built by contractor W. A. Pitman in the Commercial style. The Grange Hall served as a meeting place for local farmers to discuss agricultural affairs and propose farm policy to legislators. The National Farmers Union\'s newspaper, the "Union Farmer", was published from the Somerset Grange Hall until 1914. The building also served as a local social center and hosted township elections, club meetings, and community events. The hall was rehabilitated in 1988; it still serves as a township polling place.', 'title': 'Grange Hall (Murphysboro, Illinois)'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "In the United Kingdom, the Accession Council is a ceremonial body which assembles in St James's Palace upon the death of a monarch (Demise of the Crown), to formally proclaim the accession of his or her successor to the throne. Under the terms of the Act of Settlement 1701, a new monarch succeeds automatically. The proclamation confirms by name the identity of the heir who has succeeded.", 'title': 'Accession Council'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "The Great Hall of the People is a state building located at the western edge of Tiananmen Square in Beijing. It is used for legislative and ceremonial activities by the People's Republic of China (PRC) government and the ruling Communist Party of China. The Great Hall functions as the meeting place for the full sessions of the Chinese parliament, the National People's Congress (NPC), which occurs every year during March along with the national session of the Chinese People's Political Consultative Conference (CPPCC), a political advisory body. It is also the meeting place of the National Congress of the Communist Party of China, which, since 1982, has occurred once every five years.", 'title': 'Great Hall of the People'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': "Mark Masons' Hall in London is the headquarters of The Grand Lodge of Mark Master Masons of England and Wales, which also controls the Royal Ark Mariner degree. It is located in 86 St James's Street in the central London district of St James's, opposite St James's Palace. While Freemasons' Hall is the headquarters of the United Grand Lodge of England and the Supreme Grand Chapter of Royal Arch Masons of England, Mark Masons' Hall is the home of several other important appendant orders of Freemasonry in England and Wales.", 'title': "Mark Masons' Hall, London"}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': "Blackman-Bosworth Store, also known as Bosworth Store Building, S.N. Bosworth's Cheap Cash Store, David Blackman's Store, and Randolph County Museum, is a historic general store located at Beverly, Randolph County, West Virginia, United States. It consists of the original section, built about 1828, with an addition built in 1894. The original section is a two-story brick building on a cut-stone foundation. In addition to being operated as a general store into the 1920s, the building had short-term use as county courthouse, post office and semi-official meeting place. In 1973, the Randolph County Historical Society purchased the property, and it now serves as the Randolph County Museum and as a meeting place.", 'title': 'Blackman-Bosworth Store'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Pollokshields Burgh Hall stands at the edge of Maxwell Park, Glasgow, Scotland. Designed by Henry Edward Clifford and constructed in 17th-century Scottish Baronial style, this was opened in 1890 by Sir John Stirling Maxwell as a Masonic Meeting Place and for the use of the community but served the independent burgh of Pollokshields only until 1891 when the rapidly expanding city swallowed up the area. The hall contained various council offices and a courtroom. It continues to this day as a Masonic meeting place, hence the numerous Masonic symbols in the carvings (especially at the back of the building) and in the stained-glass windows.', 'title': 'Pollokshields Burgh Hall'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': "St James's Palace is the most senior royal palace in the United Kingdom. Located in the City of Westminster, although no longer the principal residence of the monarch, it is the ceremonial meeting place of the Accession Council and the London residence of several members of the royal family.", 'title': "St James's Palace"}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Crowther Masonic Hall or Freemasons' Hall in Kollam is a part of the Grand Lodge of India and it was a meeting place for many Masonic Lodges in the Quilon(Kollam) area. It is near Kochupilamoodu in Kollam city and has been a Masonic meeting place since 1806. The building is now considered as a historic monument of Freemasonry activities in ancient Travancore area.", 'title': 'Crowther Masonic Hall'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'In the Canadian cabinet, the President of The Queen\'s Privy Council for Canada (French: "President du Conseil privé de la Reine pour le Canada" ) is nominally in charge of the Privy Council Office. The President of the Privy Council also has the largely ceremonial duty of presiding over meetings of the Queen\'s Privy Council for Canada, a body which only convenes in full for affairs of state such as the accession of a new Sovereign or the marriage of the Prince of Wales or heir presumptive to the Throne (see Monarchy in Canada). Accordingly, the last time the President of the Privy Council had to preside over a meeting of the Privy Council was in 1981 on the occasion of Charles, Prince of Wales\' engagement to Lady Diana Spencer. It is the equivalent of the office of Lord President of the Council in the United Kingdom.', 'title': "President of the Queen's Privy Council for Canada"}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Warriparinga (meaning "Windy Place" in the local Kaurna language) is a nature reserve comprising 3.5 ha in the metropolitan suburb of Bedford Park, in the southern suburbs of Adelaide, South Australia. It has historical, cultural and environmental significance as a traditional Kaurna ceremonial meeting place and as a site of early European settlement. Also known as Fairford, Laffer\'s Triangle and the Sturt Triangle, Warriparinga is bordered by Marion Road, Sturt Road and South Road, and is traversed by the Sturt River as it exists from Sturt Gorge to travel west across the Adelaide Plains.', 'title': 'Warriparinga'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Paradigmatic analysis is the analysis of paradigms embedded in the text rather than of the surface structure (syntax) of the text which is termed syntagmatic analysis. Paradigmatic analysis often uses commutation tests, i.e. analysis by substituting words of the same type or class to calibrate shifts in connotation.', 'title': 'Paradigmatic analysis'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Netchain analysis is a theoretical concept integrating supply chain management and network analysis which was introduced by Lazzarini, Chaddad and Cook in 2001. While supply chain analysis focuses on vertical and network analysis on horizontal inderdependencies across companies, netchain analysis incorporates both type of interdependencies into one concept. Netchain analysis emphasizes value creation and coordination mechanism sources corresponding to different kind of interdependencies. In practice, netchain analysis is often used in a more general way referring to the perspective that takes into account chain and network characteristics as well. However, it differs in the focus and in the tools used from network science.', 'title': 'Netchain analysis'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Rudolf von Laban, also known as Rudolf Laban (Hungarian: "Rezső Lábán de Váraljas, Lábán Rezső, Lábán Rudolf" ) (15 December 1879 – 1 July 1958), was a dance artist and theorist. He is notable as one of the pioneers of modern dance in Europe. His work laid the foundations for Laban Movement Analysis, Labanotation (Kinetography Laban), other more specific developments in dance notation and the evolution of many varieties of Laban Movement Study. He is considered to be one of the most important figures in the history of dance.', 'title': 'Rudolf von Laban'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Irmgard Bartenieff (1900 Berlin - 1981 New York City) was a dance theorist, dancer, choreographer, physical therapist, and a leading pioneer of dance therapy. A student of Rudolf Laban, she pursued cross-cultural dance analysis, and generated a new vision of possibilities for human movement and movement training. From her experiences applying Laban’s concepts of dynamism, three-dimensional movement and mobilization to the rehabilitation of people affected by polio in the 1940s, she went on to develop her own set of movement methods and exercises, known as Bartenieff Fundamentals.', 'title': 'Irmgard Bartenieff'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Typestate analysis, sometimes called protocol analysis, is a form of program analysis employed in programming languages. It is most commonly applied to object-oriented languages. Typestates define valid sequences of operations that can be performed upon an instance of a given type. Typestates, as the name suggests, associate state information with variables of that type. This state information is used to determine at compile-time which operations are valid to be invoked upon an instance of the type. Operations performed on an object that would usually only be executed at run-time are performed upon the type state information which is modified to be compatible with the new state of the object.', 'title': 'Typestate analysis'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Optimal Discriminant Analysis (ODA) and the related classification tree analysis (CTA) are exact statistical methods that maximize predictive accuracy. For any specific sample and exploratory or confirmatory hypothesis, optimal discriminant analysis (ODA) identifies the statistical model that yields maximum predictive accuracy, assesses the exact Type I error rate, and evaluates potential cross-generalizability. Optimal discriminant analysis may be applied to >\xa00 dimensions, with the one-dimensional case being referred to as UniODA and the multidimensional case being referred to as MultiODA. Classification tree analysis is a generalization of optimal discriminant analysis to non-orthogonal trees. Classification tree analysis has more recently been called "hierarchical optimal discriminant analysis". Optimal discriminant analysis and classification tree analysis may be used to find the combination of variables and cut points that best separate classes of objects or events. These variables and cut points may then be used to reduce dimensions and to then build a statistical model that optimally describes the data.', 'title': 'Optimal discriminant analysis'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The charitable foundation Zeit-Stiftung Ebelin und Gerd Bucerius (house style: ZEIT-Stiftung) is registered in Hamburg. Its aim is to fund projects in research and scholarship, arts and culture, as well as education and training. It was founded in 1971 by Gerd Bucerius and carries the name of the founder, the title of the weekly newspaper "Die Zeit", which he co-founded, and the nickname of his second wife, Gertrud Ebel, "Ebelin".', 'title': 'ZEIT-Stiftung'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'A Nissen fundoplication, or laparoscopic Nissen fundoplication when performed via laparoscopic surgery, is a surgical procedure to treat gastroesophageal reflux disease (GERD) and hiatal hernia. In GERD, it is usually performed when medical therapy has failed; but, with a Type II (paraesophageal) hiatus hernia, it is the first-line procedure. The Nissen fundoplication is total (360°), but partial fundoplications known as Thal (270° anterior), Belsey (270° anterior transthoracic), Dor (anterior 180–200°), Lind (300° posterior), and Toupet fundoplications (posterior 270°) are alternative procedures with somewhat different indications and outcomes.', 'title': 'Nissen fundoplication'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Alcohol congener analysis of blood and urine is used to provide an indication of the type of alcoholic beverage consumed. The analysis involves investigating compounds called congeners that give the beverage a distinctive appearance, aroma, and flavour, not including water and ethanol. The theory of discovering one’s drinking habits has been investigated since the late 1970s, predominantly in Germany, for "hip-flask" defence type cases (after-drinking). Alcohol congener analysis can play a crucial role in these cases where the driver is apprehended some time after a motor vehicle incident who, when returning a positive alcohol reading then claim that this is due to drinking an alcoholic beverage only after the incident. This traditional methodology for congener analysis has focused solely on the detection of fermentation by-product congeners that are found in all alcoholic beverages. By comparing the ratios of a set standard of congeners, the ingested alcoholic beverage type is proposed.', 'title': 'Alcohol congener analysis'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Gerd Neggo (9 November 1891 – 1 September 1974) was an Estonian dancer, dance teacher and choreographer. She studied the musical response methods of É. Jaques-Dalcroze, trained under Rudolf von Laban in Hamburg, Germany, and in 1924 established her own dance studio at Tallinn, Estonia, and promoted modern dance and mime based on classical ballet. During the Soviet occupation of Estonia, she and her husband Paul Olak migrated to Sweden. Her contributions to the cultural heritage of Estonia, as the founder of modern dance and mime in her country, is recognised via a scholarship, awarded annually since 2011.', 'title': 'Gerd Neggo'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "The Jono El Grande Orchestra was formed in 2000 by composer Jono El Grande. TJEGO exclusively performs Jono El Grande's music and consists of selected musicians who have played with Oslo Philharmonic Orchestra, Oslo Sinfonietta and Poing.", 'title': 'The Jono El Grande Orchestra'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Icehouse pieces, or Icehouse Pyramids, Treehouse pieces, Treehouse Pyramids and officially Looney Pyramids, are nestable and stackable pyramid-shaped gaming pieces and a game system. The game system was invented by Andrew Looney and John Cooper in 1987, originally for use in the game of Icehouse.', 'title': 'Icehouse pieces'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'El Grande is a German-style board game for 2-5 players, designed by Wolfgang Kramer and Richard Ulrich, and published in 1995 by Hans im Glück in German, by Rio Grande Games in English, and by 999 Games in Dutch. The game board represents renaissance-era Spain where the nobility (the Grandes) fight for control of the nine regions. "El Grande" was awarded the Spiel des Jahres prize and the Deutscher Spiele Preis in 1996.', 'title': 'El Grande'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Treehouse is a game in which players try to get their configuration of Icehouse pieces to match the central configuration, shared by all players. The rolling of the special "Treehouse Die" tells the player what kind of move to make to change his own or the central configuration, and then he does so to best move towards the goal.', 'title': 'Treehouse (game)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'The Royal Basilica of San Francisco el Grande (in Spanish : Real Basílica de san Francisco el Grande) is a Roman Catholic church in central Madrid, Spain, located in the Barrio (neighborhood) of La Latina. The main façade faces the Plaza of San Francisco, at the intersection of Bailén, the Gran Vía de san Francisco, and the Carrera de san Francisco. It forms part of the convent of Jesús y María of the Franciscan order. The convent was founded in the 13th century at the site of a chapel.', 'title': 'Basilica of San Francisco el Grande, Madrid'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Juan Ignacio Paulino Ramírez Calzada, known as Ignacio Ramírez, (22 June 1818 – 15 June 1879) was a Mexican writer, poet, journalist, lawyer, atheist, and political libertarian from San Miguel de Allende, then called San Miguel el Grande. His father had been a prominent federalist politician. In writings, Ramírez used the pen name, El Nigromante (The Necromancer). He defended the rights of Indians. Ramírez worked with Guillermo Prieto to start the satirical periodical, "Don Simplicio". Ramírez is considered a member of the "\'romantic generation\' of Mexican liberals" coinciding with the Liberal Reform; others were Ponciano Arriaga, Miguel Lerdo de Tejada, Melchor Ocampo, and Guillermo Prieto.', 'title': 'Ignacio Ramírez'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'He was a professor of poetry at the Reales Estudios de San Isidro in Madrid. He authored a neoclassical tragedy, "Numancia destruida" (1775). His works were mainly heroic romances. He was also a respected historian, authoring history books on Frederick the Great ("Historia de Federico el Grande, rey de Prusia") (1782), the History of Gibraltar ("Historia de Gibraltar") (1782) and the Council of Trent ("El sacrosanto y ecuménico concilio de Trento") (1787). These works gained him membership of the Real Academia de la Historia. In his later years he also wrote on astronomy, "Disertaciones astronómicas" and "Filosofía moral de Aristóteles", astronomical dissertations and the moral philosophy of Aristotle. He was a member of the Real Academia de Bellas Artes de San Fernando. He died on 24 April 1789 in Tarifa.', 'title': 'Ignacio López de Ayala'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Zapotlán el Grande (also known as Guzmán, and Ciudad Guzmán) is a municipality in the Mexican state of Jalisco. There are several meaninings given to the root name of the "Zapotlán el Grande" "TzapoTl is the name given to all the round fruits from the general region. Another well known fact among the locals it states The full name Zapotlán means my round fruits in the ancient language. round sweet fruits not exactly zapotes as most people believe; however it means Guavas, Tunas, Tejocotes, Cherries found in this region and still found in the low wet valleys. A new theory of the name is Tzapot which ends with Tzapotlan and it refers to the goddess of medicine named Tzaputlatena.', 'title': 'Zapotlán el Grande'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Francisco Isaías Lemus Muñoz Ledo (born 23 February 1961) is a Mexican politician affiliated with the National Action Party. In 2003 he was Deputy plurinominal Local PAN in Guanajuato LVIII Legislature . President of the Commission of Public Works and Urban Development ; Member of the Commission of Education, Culture and Publishing Affairs ; Member of the Committee on Environment and Ecology. As of 2014 he served as Deputy of the LIX Legislature of the Mexican Congress representing Guanajuato, 1991 candidate for alderman of the municipality of Apaseo El Grande, Guanajuato 1994 candidate for mayor of Apaseo El Grande, Guanajuato, PAN 1996 active members, 1997 PAN candidate of a local deputy Guanajuato, from 1997 to 2000 Secretary of organization of CDM PAN Apaseo el Grande, Guanajuato, from 1997 to 2002 Political Advisor in the CDM PAN Apaseo el Grande, Guanajuato, from 2001 to 2003 State Counsel in the CDE PAN in Leon, Guanajuato', 'title': 'Francisco Lemus Muñoz'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Sergio Enrique Villarreal Barragán, a.k.a. El Grande, (b. September 21, 1969), is a former Mexican federal police officer who then worked as a lieutenant for Arturo Beltrán Leyva of the criminal organization called the Beltrán Leyva Cartel. He got his name "El Grande" ("The Big One") because he is 6 ft tall. He was the leader of "cartel del sur".', 'title': 'Sergio Villarreal Barragán'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'EverQuest Role-Playing Game is a role-playing game based on the "EverQuest" fantasy massively multiplayer online role-playing game (MMORPG). The game was published by White Wolf under its Sword and Sorcery Studios imprint. "EverQuest Role-Playing Game" shares many things with the MMORPG, such as setting, available races and classes, monsters, spells, and items.', 'title': 'EverQuest Role-Playing Game'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Universe: The Role-Playing Game of the Future is a science fiction role-playing game published by Simulation Publications, Inc (SPI) from 1981 to 1983. It was praised for its innovative and tightly organized rules for such sci-fi RPG concerns as generating planets, applying character skills to in-game situations, and resolving the initial moments of alien encounters; however, it was also criticized for its cumbersome encounter/combat system and its lack of compelling background material. "Universe" was also noted for its "striking" Interstellar Display, a poster-sized, astronomically accurate map of all stars within 30 light-years of Earth.', 'title': 'Universe (role-playing game)'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Falling Stars is a role-playing video game developed by Ivolgamus and published by Nordcurrent in Europe and by Agetec in North America. It was released on August 24, 2007 in Europe for Microsoft Windows and the PlayStation 2 and on August 26, 2008 in the United States for the PlayStation 2. The game is aimed at young children and was released with a price point lower than most PS2 games.', 'title': 'Falling Stars (video game)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Matt James (born 1981) is an American game designer and a decorated veteran of the United States Army. As a game designer, James is best known for his online and print works for the "Dungeons & Dragons" fantasy role-playing game published by Wizards of the Coast, "Pathfinder" role-playing game by Paizo, and Privateer Press. He has also designed game content for Wolfgang Baur\'s Kobold Press (formerly Open Design LLC). In 2012 James won an ENnie Award for "" and has been nominated for several Origins Awards. In 2014, James won an ENnie Award for "".', 'title': 'Matt James (game designer)'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Nordcurrent is a Lithuanian and international developer and publisher of casual game and Freemium games for the iOS, Android, Amazon, PC and Mac platforms.', 'title': 'Nordcurrent'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Stormbringer fantasy role-playing game published by Chaosium puts the players in the world of the Young Kingdoms, based on the Elric of Melniboné books by Michael Moorcock. The game takes its name from Elric\'s sword, Stormbringer (though one edition was published as "Elric!") and uses the Basic Role-Playing game system, a percentile-dice-based system used in many role-playing games designed by Chaosium.', 'title': 'Stormbringer (role-playing game)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The World of Indiana Jones is a role-playing game published by West End Games, based on the Indiana Jones franchise. West End Games acquired the rights to publish an Indiana Jones role-playing game ten years after the publication of TSR\'s "The Adventures of Indiana Jones Role-Playing Game" (1984).', 'title': 'The World of Indiana Jones'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'James Bond 007: Role-Playing In Her Majesty\'s Secret Service is a spy fiction role-playing game based on the James Bond books and films. The game was designed by Gerard Christopher Klug and published by Victory Games (a branch of Avalon Hill). The game and its supplements were published from 1983 until 1987, when the license lapsed. At that time, it was the most popular espionage role-playing game. "James Bond 007: Role-Playing In Her Majesty\'s Secret Service" won an Origins Award in 1983 and a Strategists\' Club Award as Outstanding Role-Playing Game in 1984.', 'title': 'James Bond 007 (role-playing game)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Macross II: The Role-Playing Game is a role-playing game published by Palladium Books in 1993. Based on the "Macross II" mecha OVA and manga series, the game is structured around Palladium\'s Megaversal damage system.', 'title': 'Macross II: The Role-Playing Game'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Advanced d20 Magic is an alternative spellcasting system for the "Dungeons and Dragons" role-playing game and the d20 System role-playing game. It is published by Guardians of Order, the producers of the Big Eyes Small Mouth game and the Slayers d20 game. The system presents a DC-based Magic System similar to the Sovereign Stone game published by Sovereign Press.', 'title': 'Advanced d20 Magic'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Warriors' Path State Park is a 950\xa0acre (3.84\xa0km²) Tennessee State Park in Colonial Heights, Kingsport, Sullivan County, Tennessee, in the United States. It is named for the Great Indian Warpath that was used by the Iroquois in war raids with the Cherokee and other tribes. The park is located around the Fort Patrick Henry Reservoir and Duck Island on the South Fork Holston River. This land was acquired from the Tennessee Valley Authority in 1952.", 'title': "Warriors' Path State Park"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'The Catawba Trail is a trail developed and used by Native Americans that leads from the Carolinas northerly into Ohio, Indiana and Pennsylvania. Its several branches led from western Virginia, through West Virginia, Kentucky, and eastern Tennessee. It is a part of the Great Indian Warpath. Its South Carolina and North Carolina origination passes through the Unaka Mountains and the Allegheny Mountains.', 'title': 'Catawba Trail'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Great Indian Warpath (GIW)—also known as the Great Indian War and Trading Path, or the Seneca Trail—was that part of the network of trails in eastern North America developed and used by Native Americans which ran through the Great Appalachian Valley. The system of footpaths (the Warpath branched off in several places onto alternate routes and over time shifted westward in some regions) extended from what is now upper New York state to deep within Alabama. Various Indians traded and made war along the trails, including the Catawba, numerous Algonquian tribes, the Cherokee, and the Iroquois Confederacy. The British traders\' name for the route was derived from combining its name among the northeastern Algonquian tribes, "Mishimayagat" or "Great Trail", with that of the Shawnee and Delaware, "Athawominee" or "Path where they go armed".', 'title': 'Great Indian Warpath'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Warriors Path State Park is a Pennsylvania state park on 349 acre in Liberty Township, Bedford County, Pennsylvania, in the United States. It is named for the Great Indian Warpath that was used by the Iroquois in war raids with the Cherokee and other tribes. Warriors Path State Park is surrounded on three sides by the Raystown Branch Juniata River. The park is a seasonal day use park.The park can be accessed by foot from the main gate when the gate is closed November through mid April.', 'title': 'Warriors Path State Park'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The Shawnee Trail was the white settlers\' name for an American Indian trail in what is now eastern West Virginia, USA. It was a segment (or branch) of the much larger Indian trail network known as the Great Indian Warpath, which stretched from New York to Alabama. The GIW was referred to from this point north as the "Seneca Trail". Thus, in pioneer days, the segment known as the Shawnee Trail was often also referred to as the Seneca Trail.', 'title': 'Shawnee Trail (West Virginia)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'U.S. Route 219 is a spur of U.S. Route 19. It runs for 535 mi from West Seneca, New York at an interchange with Interstate 90, to Rich Creek, Virginia, intersecting at U.S. Route 460. U.S. 219 is found (from north to south) in New York, Pennsylvania, Maryland, West Virginia, and Virginia. Much of the Route in West Virginia follows the old Indian warpath known as the Seneca Trail (Great Indian Warpath).', 'title': 'U.S. Route 219'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Kutch Bustard Sanctuary or Kachchh Great Indian Bustard Sanctuary, also known as Lala–Parjan Sanctuary, is located near Jakhau village in Nalia Taluka, Kutch District, Gujarat, India. This sanctuary is one of the two great Indian bustard sanctuaries in Gujarat; the other one is in Jamnagar. It was declared as a sanctuary in July 1992, specifically for the conservation of the great Indian bustard, the heaviest flying bird belonging to the avian family of Otididae. However, the sanctuary presently legally covers a protected area of about 2 km2 of area (202.86 ha of fenced land only and is the smallest sanctuary in the country. Several suggestions have been made to vastly increase the size of this sanctuary as it is a breeding ground of the endangered great Indian bustard. The reason is that its ecological zone is much larger on account of anthropogenic and cattle population pressure that are considered as a ‘biotic threat’ to this omnivorous species.', 'title': 'Kutch Bustard Sanctuary'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Gustaf Dalstrom (1893-1971) was an American artist and muralist. From 1927, he served as president of the Chicago Society of Artists. During the Great Depression he contributed several mural paintings to public schools and post offices through the Treasury Department Section of Painting and Sculpture (later called The Treasury Section of Fine Arts). One of his murals that can still be viewed today is The Great Indian Council - 1833. The mural was originally featured in 1938, paired with a mural his wife, Frances Foy, created in The Old Main Post Office of Chicago. "The Great Indian Council - 1833" can be viewed in the current location of the South Loop Post Office in Chicago, Illinois.', 'title': 'Gustaf Dalstrom'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Texas Road, also known as the Shawnee Trail, Sedalia Trail or the Kansas Trail, was a major trade and emigrant route to Texas across Indian Territory (later Oklahoma, Kansas and Missouri). Established during the Mexican War by emigrants rushing to Texas, it remained an important route across Indian Territory until Oklahoma statehood. The Shawnee Trail was the earliest and easternmost route by which Texas Longhorn cattle were taken to the north. It played a significant role in the history of Texas, Oklahoma, Missouri and Kansas in the early and mid-1800s.', 'title': 'Texas Road'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Originally The Great Indian Comedy Show, The Comedy Show ha ha ha is a half-hour stand-up and sketch comedy show in Hindi. The program was first aired in October 2004. The program, hosted by various members of the ensemble, others to host include: winners of The Great Indian Laughter Challenge. In 2007, the program was renamed hanso India hanso due to confusion between "The Great Indian Comedy Show" and "The Great Indian Laughter Challenge".', 'title': 'The Great Indian Comedy Show'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The Jungle Cruise is an attraction located in Adventureland at many Disney Parks, including Disneyland, Magic Kingdom, and Tokyo Disneyland. At Hong Kong Disneyland, the attraction is named Jungle River Cruise. Disneyland Paris and Shanghai Disneyland are the only Magic Kingdom-style Disney parks that do not have the Jungle Cruise in their attraction rosters.', 'title': 'Jungle Cruise'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Hong Kong Disneyland () is a theme park located on reclaimed land in Penny's Bay, Lantau Island. It is located inside the Hong Kong Disneyland Resort and it is owned and managed by Hong Kong International Theme Parks. It is, together with Ocean Park Hong Kong, one of the two large theme parks in Hong Kong. Hong Kong Disneyland opened to visitors on Monday, 12 September 2005 at 13:00 HKT. Disney attempted to avoid problems of cultural backlash by incorporating Chinese culture, customs, and traditions when designing and building the resort, including adherence to the rules of feng shui. For instance, a bend was put in a walkway near the Hong Kong Disneyland Resort entrance so good qi energy wouldn't flow into the South China Sea.", 'title': 'Hong Kong Disneyland'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Playhouse Disney Hong Kong is a Playhouse Disney-branded pay cable television channel for viewers in Hong Kong based in Kowloon Peninsula and is available in 3-national languages: English, Cantonese and Chinese. This channel is only available on Cable TV Hong Kong in Hong Kong on Channel 136, Now TV in Hong Kong on Channel 442 and HKBN bbTV in Hong Kong on Channel 312. The old name for Playhouse Disney Hong Kong was Disney Channel Asia. English, Cantonese and Chinese are available 24-hours in daily. Playhouse Disney Hong Kong's main competitors are Hong Kong Disneyland. Lindsay Lohan was the ambassador for Playhouse Disney Hong Kong.", 'title': 'Playhouse Disney Hong Kong'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Mystic Point () is a section of Hong Kong Disneyland that officially opened to the public on 17 May 2013. Prior to that it had a soft opening for a selected audience. It is set in a dense, uncharted rain forest surrounded by mysterious forces and supernatural events. The site features Mystic Manor, a Haunted Mansion style attraction with the same trackless ride system developed at Pooh's Hunny Hunt in Tokyo Disneyland. Mystic Point, along with Grizzly Gulch and Toy Story Land has been exclusive to Hong Kong Disneyland among all Disney theme parks for 5 years from opening. Composer Danny Elfman scored the music for the Mystic Manor dark ride attraction. It is the final land to open in Hong Kong Disneyland's three land expansion plan approved in July 2009.", 'title': 'Mystic Point'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Robert Henry "Bob" Gurr (born October 25, 1931 in Los Angeles, California) is an American amusement ride designer and Imagineer. His most famous work was for Walt Disney\'s Disneyland Park, and its subsequent sister parks. Gurr is said to have designed most, if not all, of the ride vehicles of the Disneyland attractions, including Autopia, Haunted Mansion, the Disneyland Monorail, the Submarine Voyage, and the Matterhorn Bobsleds. He was named a Disney Legend in 2004. He also worked on the King Kong Encounter animatronic for Universal Studios Hollywood.', 'title': 'Bob Gurr'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Snow White Grotto is an attraction at Disneyland in Anaheim, California which originally opened on April 9, 1961, Tokyo Disneyland at the Tokyo Disney Resort in Japan in 1983, and at Hong Kong Disneyland in Hong Kong in 2005. It is a wishing well located at the east of Sleeping Beauty Castle for Disneyland and west for Hong Kong Disneyland and Cinderella Castle for Tokyo Disneyland. Guests can throw a coin and make a wish in front of the grotto.', 'title': 'Snow White Grotto'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Skyway was a gondola lift attraction at Disneyland, at the Magic Kingdom, and at Tokyo Disneyland. Since all versions of this attraction took riders back and forth between Fantasyland and Tomorrowland, the route from Tomorrowland was called Skyway to Fantasyland, and the route from Fantasyland was called Skyway to Tomorrowland.', 'title': 'Skyway (Disney)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Rocket Jets was an attraction in Disneyland at the Disneyland Resort in Anaheim, California. This attraction opened in 1967 with the new Tomorrowland and closed in 1997 for the 1998 New Tomorrowland. It was the third spinning rocket attraction in Tomorrowland and stood three stories above the ground. When Tomorrowland was redone for 1998, the Rocket Jets were replaced by a new attraction based on Orbitron at the entrance to Discoveryland in Disneyland Park Paris.', 'title': 'Rocket Jets'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Iron Man Experience (Traditional Chinese: 鐵甲奇俠飛行之旅) is a 3-D motion simulator attraction in Tomorrowland at Hong Kong Disneyland, which opened on 11 January 2017. The attraction is based on the Marvel Comics character Iron Man, becoming the first Disney attraction to be based on a Marvel property. Set at the fictional Stark Expo, the attraction features Tony Stark recruiting guests to fend off extraterrestrial beings that are attacking Hong Kong.', 'title': 'Iron Man Experience'}
 {'idx': 9, 'is_supporting': True, 'paragraph_text': 'Autopia is a Disneyland attraction, in which patrons steer specially designed cars through an enclosed track. Versions of Autopia exist at Anaheim, California and Disneyland Paris in Marne-la-Vallée, France. There was also an Autopia at Hong Kong Disneyland on Lantau Island, Hong Kong before it closed on June 11, 2016. Other versions of the attraction can be found at the Magic Kingdom as the Tomorrowland Speedway and formerly at Tokyo Disneyland as the Grand Circuit Raceway.', 'title': 'Autopia'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Christmas tree production in Canada totals from 3 to 6 million trees annually. Trees are produced in many of the provinces of Canada but the nation's leading producers are found in Quebec, Nova Scotia and Ontario, which account for 80 percent of Canadian tree production. Of the 900,000 trees produced annually in British Columbia, most are cut from native pine stands.", 'title': 'Christmas tree production in Canada'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': 'Ainslie Glen (Scottish Gaelic: "Gleann nam Màgan" ) is a small community in the Canadian province of Nova Scotia, located in Inverness County on Cape Breton Island. In 2016, a tree on Crown Lands was chosen to become the Boston Christmas Tree.', 'title': 'Ainslie Glen, Nova Scotia'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': "The Boston Christmas Tree is the City of Boston, Massachusetts' official Christmas tree. A tree has been lit each year since 1941, and since 1971 it has been given to the people of Boston by the people of Nova Scotia in thanks for their assistance after the 1917 Halifax Explosion. The tree is lit in the Boston Common throughout the Christmas season.", 'title': 'Boston Christmas Tree'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Benjamin Green (July 1, 1713 – October 14, 1772) was a merchant, judge and political figure in Nova Scotia. He served as administrator for Nova Scotia in 1766 and from 1771 to 1772. He was born in Salem Village (later Danvers, Massachusetts), the son of the Reverend Joseph Green and Elizabeth Gerrish, and entered business with his brothers in Boston. In 1737, he married Margaret Pierce. He was secretary to William Pepperrell, who led the attack against Louisbourg in 1745, and served as treasurer for the forces from New England and secretary for the council that administered Louisbourg after its capture. In 1749, he went to Halifax, where he was named to Edward Cornwallis's Nova Scotia Council and also served as naval officer. Green was also judge in the vice admiralty court; he resigned in 1753. In 1750, he became secretary to the Council and provincial treasurer. Green was named a justice of the peace in 1760. While in England to assist in auditing the accounts of Peregrine Thomas Hopson, he had to defend himself against charges of assigning contracts to Malachy Salter in exchange for a share in the profits. He was reprimanded but allowed to retain his posts. During his term as administrator in 1766, he was criticized by the provincial assembly for not following the correct procedures for dealing with the provincial finances. Green resigned his post as provincial treasurer in 1768, citing poor health.", 'title': 'Benjamin Green (merchant)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'French Village is a rural community of the Halifax Regional Municipality in the Canadian province of Nova Scotia on Chebucto Peninsula. French village initially included present day villages of Tantallon, Glen Haven and French Village. The French that migrated to the area were French speaking families from the Principality of Montbeliard (annexed by France 1793)and known as the "Foreign Protestants". They had come to Nova Scotia between 1750 and 1752 to settle Lunenburg, Nova Scotia. Contrary to belief, they were not Huguenots. In 1901, the Halifax and Southwestern Railway was built through the area and the railway choose the name French Village for the station serving the three communities. The French Village station, actually located in Tantallon, has been preserved as a cafe beside the recreational trail that follows the old Halifax & Southwestern Railway roadbed.', 'title': 'French Village, Nova Scotia'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Christmas Island, Nova Scotia "(Scottish Gaelic: Eilean na Nollaig)" is a Canadian community of the Cape Breton Regional Municipality in Cape Breton, Nova Scotia. It has a post office, a firehall and a very small population. It also has a beach with access to the Bras d\'Or lakes, and a pond that runs into the lake. Christmas Island got its name because of a native that lived there whose surname was Christmas. He died on Ghost Island, adjacent to the beach. The original inhabitants of the land, the Mi\'kmaw people, called the area "Abadakwichéch", which means "the small reserved portion."', 'title': 'Christmas Island, Nova Scotia'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Malachy Salter (February 28, 1715 – January 13, 1781), a Nova Scotia merchant and office-holder, was born at Boston, second son of Malachy Salter and Sarah Holmes. He married Susanna Mulberry, on 26 July 1744 in Boston, and they had at least 11 children. He died at Halifax, Nova Scotia and is buried in the Old Burying Ground (Halifax, Nova Scotia) (His son Malachi Salter (d.1752) has the oldest grave marker in the burying ground).', 'title': 'Malachy Salter'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The first official Christmas tree in the city of Chicago was installed in 1913 in Grant Park and lit on Christmas Eve by then-mayor Carter Harrison. This first tree was a 35 ft tall spruce tree. In December 1956 the official tree, though still installed in Grant Park (at Michigan Avenue and Congress Parkway), was not an individual tree. The tree was a combination of many smaller trees, stood 70 ft tall, and was decorated with over 4000 lights and 2000 ornaments. Beginning with Christmas 1966 the official Chicago Christmas tree was placed in Civic Center Plaza, now known as Daley Plaza. With the exception of 1981, the tree has been installed in Daley Plaza ever since.', 'title': 'Chicago Christmas Tree'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'The Mount Ingino Christmas Tree is a lighting illumination in the shape of a Christmas tree that is installed annually on the slopes of Mount Ingino (Monte Ingino in Italian) outside the city of Gubbio, in Umbria region in Italy. The tree is also called the Gubbio Christmas Tree or "the biggest Christmas tree in the world". In 1991 the Guinness Book of Records named it "The World\'s Largest Christmas Tree".', 'title': 'Mount Ingino Christmas Tree'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Foster Hutchinson Jr. (d. 1815) was a member of the Nova Scotia Council and one of the Puisne judges of the Supreme Court of Nova Scotia. He was the only son of Foster Hutchinson (judge), Sr., the nephew of Governor of Massuchsetts Thomas Hutchinson and grandchild of Governor of Nova Scotia Paul Mascarene. He arrived in Halifax from Boston with his father as Loyalists (1776). Hutchinson became a lawyer and worked under Chief Justice Thomas Andrew Lumisden Strange. Sir George Prévost appointed him an Assistant Justice to the Supreme Court (1809). He is buried in the Old Burying Ground (Halifax, Nova Scotia).', 'title': 'Foster Hutchinson (jurist)'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Finncattle refers to three closely related cattle breeds of Finnish origin. Finncattle is most often kept for dairy production, and some animals are found in petting zoos and as pets. The Finncattle breeds are of small size and naturally polled, however they differ in appearance and production levels. The Western Finncattle is red, and the largest of the three breeds. The North Finnish cattle variety are white, the West Finnish are red, while the East Finnish are both white and red.', 'title': 'Finncattle'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "Chiari-like malformation (CM) is the most common cause of foramen magnum obstruction and syringomyelia in dogs. Syringomyelia (SM) is a disease of the spinal cord typified by fluid filled cavities, or syrinxes, within the spinal cord substance. The disease is caused by the obstruction of cerebrospinal fluid (CSF), in the nervous system. A situation of high pressure in the spinal cord compared to low pressure outside, leads to fluid accumulation, which eventually forms cavities. CM is a condition characterized by the mismatch of size between the brain and the skull. The skull is too small causing part of the brain to descend out of the skull through the opening at its base, crowding the spinal cord. The cause of CM is not yet fully understood. CM is rare in most breeds but reportedly has become very widespread in the Cavalier King Charles Spaniel and the Griffon Bruxellois (Brussels Griffon). Some researchers estimate that as many as 95% of CKCSs may have CM. It is worldwide in scope and not limited to any country, breeding line, or kennel, and experts report that it is believed to be inherited in the Cavalier King Charles Spaniel. CM is so widespread in the Cavalier that it may be an inherent part of the CKCS's breed standard. This disease not only affects thousands of dogs, but a similar condition affects over three hundred thousand children yearly. Therefore, canines are an appropriate model for the treatment of the human condition.", 'title': 'Canine Chiari-like malformation'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'The Griffon Bruxellois or Brussels Griffon is a breed of toy dog, named for their city of origin: Brussels, Belgium. The Griffon Bruxellois may refer to three different breeds, the Griffon Bruxellois, the Griffon Belge and the Petit Brabançon. Identical in standard except for coat and colour differences, in some standards they are considered varieties of the same breed, much like Belgian Shepherd Dogs.', 'title': 'Griffon Bruxellois'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Rare breed (dog) is any breed of dog that is small in number and is used to refer to both old established breeds such as the Stabyhoun and Glen of Imaal Terrier or newer creations. Since dogs have greater genetic variability than other domesticated animals the number of possible breeds is vast with new crosses constantly occurring, from these both selected and random crosses may come new breeds should offspring reliably breed true to type. New breeds from the wild such as the Carolina Dog are quite rare compared to attempts at breed creation from man as found in the American Hairless Terrier which sought to exploit a mutation.', 'title': 'Rare breed (dog)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'A frizzle refers to a plumage pattern in domesticated chickens ("Gallus gallus domesticus") characterized by feathers that curl outwards, rather than lying flat as in most chickens. The frizzle type is not a separate breed, but a variety within breeds. Though all breeds of chickens may be frizzled; it is most commonly seen in breeds such as the Cochin, Pekin, and Polish. Chickens with this pattern are sometimes referred to as frizzles. The gene which causes the frizzles\' peculiar feathering is a dominant trait. As a result of its unusual look, frizzles are primarily used as exhibition birds, and are included in most English language poultry standards.', 'title': 'Frizzle (chicken plumage)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Feathering or feather is the long hair on the lower legs and fetlocks of some breeds of horse and pony. On some horses, especially draft breeds, the hair can almost cover the hooves. While nearly all horses will grow longer hair on the lower legs and back of the fetlocks at times, particularly in the winter, "feather" refers to the particularly long, luxuriant growth that is characteristic of certain breeds.', 'title': 'Feathering (horse)'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Griffon is a collection of dog breeds that were originally hunting dogs.', 'title': 'Griffon (disambiguation)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Griffon is a type of dog - a collection of breeds that were originally hunting dogs. There are three lines of the griffon type recognized by the Fédération Cynologique Internationale (FCI): the griffon vendéens, the wirehaired pointers, and the "smousje" (Belgian companion dogs or Dutch Smoushond). The griffon type is characterized by rough or wire-hair.', 'title': 'Griffon'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The Stabyhoun or Stabij is one of the top five rarest dog breeds in the world. It is from Friesland and in particular from the Frisian forest area, a region in the southeast and east of Friesland. The breed has been mentioned in Dutch literature going back to the early 1800s, but has only extended its range from the 1960s outside of Friesland and not until the 2000s did the range officially extend beyond the Netherlands. The name Stabij translates roughly as "stand by me" with the last part simply Frisian, meaning dog, which is pronounced "hoon". The dog is considered a Dutch national treasure. There are only a few thousand Stabyhouns in existence today worldwide.', 'title': 'Stabyhoun'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The North American Versatile Hunting Dog Association was founded 1969 in Goodwood, Ontario, Canada by a group of pudelpointer and griffon enthusiasts. Presently based in Arlington Heights, Illinois, NAVHDA "is a nonprofit corporation whose purpose is to foster, promote, and improve the versatile hunting dog breeds in North America; to conserve game by using well trained reliable hunting dogs before and after the shot; and to aid in the prevention of cruelty to animals by discouraging nonselective and uncontrolled breeding, which produces unwanted and uncared for dogs." The group has chapters in most states of the U.S. and provinces of Canada which sponsor training and testing programs.', 'title': 'North American Versatile Hunting Dog Association'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Hershel Parker is an American professor of English and literature, noted for his research into the works of Herman Melville. Parker is the H. Fletcher Brown Professor Emeritus at the University of Delaware. He is co-editor with Harrison Hayford of the Norton Critical Edition of Herman Melville\'s "Moby-Dick" (1967, 2001, and 2017), and the General Editor of the Northwestern-Newberry Edition of "The Writings of Herman Melville", which, with the publication of volume 13, ""Billy Budd, Sailor"" "and Other Uncompleted Writings", is now (2017) complete in fifteen-volumes. Parker is also the author of a two-volume biography of Herman Melville published by Johns Hopkins University Press (1996, 2002).', 'title': 'Hershel Parker'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Clarel: A Poem and Pilgrimage in the Holy Land (1876) is an epic poem by American writer Herman Melville, originally published in two volumes. "Clarel" is the longest poem in American literature, stretching to almost 18,000 lines (longer even than European classics such as the "Iliad", "Aeneid" and "Paradise Lost"). As well as for its great length, "Clarel" is notable for being the major work of Melville\'s later years.', 'title': 'Clarel'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'Moby-Dick; or, The Whale is a novel by American writer Herman Melville, published in 1851 during the period of the American Renaissance. Sailor Ishmael tells the story of the obsessive quest of Ahab, captain of the whaler "Pequod", for revenge on Moby Dick, the white whale that on the previous whaling voyage bit off Ahab\'s leg at the knee. The novel was a commercial failure and out of print at the time of the author\'s death in 1891, but during the 20th century, its reputation as a Great American Novel was established. William Faulkner confessed he wished he had written it himself, and D. H. Lawrence called it "one of the strangest and most wonderful books in the world", and "the greatest book of the sea ever written". "Call me Ishmael" is among world literature\'s most famous opening sentences.', 'title': 'Moby-Dick'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'Marvel Classics Comics was an American comics magazine which ran from 1976 until 1978. It specialized in adaptations of literary classics such as "Moby-Dick", "The Three Musketeers", and "The Iliad". It was Marvel Comics\' attempt to pick up the mantle of "Classics Illustrated", which stopped publishing in 1971. 36 issues of "Marvel Classics Comics" were published, 12 of them being reprints of another publisher\'s work.', 'title': 'Marvel Classics Comics'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Israel Potter: His Fifty Years of Exile is the eighth book by American writer Herman Melville, first published in serial form in "Putnam\'s Monthly" magazine between July 1854 and March 1855, and in book form by G. P. Putnam & Co. in March 1855. A pirated edition was also published in London by George Routledge in May 1855. The book is loosely based on a pamphlet (108-page) autobiography that Melville acquired in the 1840s, "Life and Remarkable Adventures of Israel R. Potter" (Providence, Rhode Island, 1824).', 'title': 'Israel Potter'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Pierre; or, The Ambiguities is a novel, the seventh book, by American writer Herman Melville, first published in New York in 1852. The plot, which uses many conventions of Gothic fiction, develops the psychological, sexual, and family tensions between Pierre Glendinning; his widowed mother; Glendinning Stanley, his cousin; Lucy Tartan, his fiancee; and Isabel Banford, who is revealed to be his half-sister. According to scholar Henry A. Murray, in writing "Pierre" Melville "purposed to write his spiritual autobiography in the form of a novel" rather than to experiment with the novel and incidentally working some personal experiences into it.', 'title': 'Pierre; or, The Ambiguities'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Typee: A Peep at Polynesian Life is the first book by American writer Herman Melville, published first in London, then New York, in 1846. Considered a classic in travel and adventure literature, the narrative is partly based on the author\'s actual experiences on the island Nuku Hiva in the South Pacific Marquesas Islands in 1842, liberally supplemented with imaginative reconstruction and adaptation of material from other books. The title is from the province Tai Pi Vai. "Typee" was Melville\'s most popular work during his lifetime; it made him notorious as the "man who lived among the cannibals".', 'title': 'Typee'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Billy Budd, Sailor is the final novel by American writer Herman Melville, first published posthumously in London in 1924 as edited by Raymond M. Weaver, a professor at Columbia University. Other versions were later published. Melville had begun writing the original work in November 1888, but left it unfinished at his death in 1891. Acclaimed by British critics as a masterpiece when published in London, it quickly took its place as a classic literary work in the United States.', 'title': 'Billy Budd'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Redburn: His First Voyage is the fourth book by the American writer Herman Melville, first published in London in 1849. The book is semi-autobiographical and recounts the adventures of a refined youth among coarse and brutal sailors and the seedier areas of Liverpool. Melville wrote "Redburn" in less than ten weeks. While one scholar describes it as "arguably his funniest work," scholar F.O. Matthiessen calls it "the most moving of its author\'s books before "Moby-Dick"".', 'title': 'Redburn'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Confidence-Man: His Masquerade is the ninth book and final novel by American writer Herman Melville, first published in New York in 1857. The book was published on April 1, the exact day of the novel\'s setting. "The Confidence-Man" portrays a "Canterbury Tales"–style group of steamboat passengers whose interlocking stories are told as they travel down the Mississippi River toward New Orleans. Scholar Robert Milder notes: "Long mistaken for a flawed novel, the book is now admired as a masterpiece of irony and control, though it continues to resist interpretive consensus." After the novel\'s publication, Melville turned from professional writing and became a professional lecturer, mainly addressing his worldwide travels, and later for nineteen years a federal government employee.', 'title': 'The Confidence-Man'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Spirit of the Border is an historical novel written by Zane Grey, first published in 1906. The novel is based on events occurring in the Ohio River Valley in the late eighteenth century. It features the exploits of Lewis Wetzel, a historical personage who had dedicated his life to the destruction of Native Americans and to the protection of nascent white settlements in that region. The story deals with the attempt by Moravian Church missionaries to Christianize Indians and how two brothers\' lives take different paths upon their arrival on the border. A highly romanticized account, the novel is the second in a trilogy, the first of which is "Betty Zane", Grey\'s first published work, and "The Last Trail", which focuses on the life of Jonathan Zane, Grey\'s ancestor.', 'title': 'Spirit of the Border'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Before We Say Goodbye, first published as Prima di Lasciarsi, is a 2004 novel by Gabriella Ambrosio. The work is based on the 2002 Kiryat HaYovel supermarket bombing and narrates the final hours in the lives of the suicide bomber and her victims. It was first published in Italy in 2004 through Nutrimenti, and was later published in English on 2 August 2010 through Walker Books. The novel has been published in multiple languages, including Arabic and Hebrew, and has been endorsed by Amnesty International.', 'title': 'Before We Say Goodbye'}
 {'idx': 2, 'is_supporting': True, 'paragraph_text': 'In addition to comic books, Mutarelli has also created plays, books, and all the illustration and animated sequences of the 2004 motion picture "Nina", which was based on the novel "Crime and Punishment" by Dostoyevsky.', 'title': 'Lourenço Mutarelli'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "4 a.m. is the debut novel of Scottish author Nina de la Mer. It was first published in the UK on 26 August 2011 by Brighton-based publishing house Myriad Editions. The novel draws on the author's personal experiences and research, covering rave culture of the 90s and peacetime life in the British Army.", 'title': '4 a.m. (novel)'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Three Comrades (German: "Drei Kameraden" ) is a novel first published in 1936 by the German author Erich Maria Remarque. It is written in first person by the main character Robert Lohkamp, whose somewhat disillusioned outlook on life is due to his horrifying experiences in the trenches of the First World War\'s French-German front. He shares these experiences with Otto Köster and Gottfried Lenz, his two comrades with whom he runs an auto-repair shop in late 1920s Berlin (probably). Remarque wrote the novel in exile and it was first published in Dutch translation as "Drie kameraden", with English translation following soon in "Good Housekeeping" from January to March 1937 and in the book form in the same year. First German language edition was published in 1938 by exile publisher "Querido" in Amsterdam, but the novel was published in Germany only in 1951.', 'title': 'Three Comrades (novel)'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Crime and Punishment (Russian: Преступлéние и наказáние , "Prestupleniye i nakazaniye"; ] ) is a novel by the Russian author Fyodor Dostoyevsky. It was first published in the literary journal "The Russian Messenger" in twelve monthly installments during 1866. Later, it was published in a single volume. It is the second of Dostoyevsky\'s full-length novels following his return from 5 years of exile in Siberia. "Crime and Punishment" is considered the first great novel of his "mature" period of writing.', 'title': 'Crime and Punishment'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Drained, (Portuguese: O Cheiro do Ralo_ is a 2006 Brazilian dark comedy film based on a novel by Lourenço Mutarelli. It was directed by Heitor Dhalia, and stars Selton Mello. The film was produced by Geração Conteúdo, Primo Filmes & RT Features.', 'title': 'Drained'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "The Golden Hour is a children's novel by Maiya Williams. It was first published in 2004 and is the first of the Golden Hour time travel series. It tells the story of Rowan Popplewell and his sister, Nina, who, while emotionally disturbed by the death of their mother, travel back in time to the French Revolution.", 'title': 'The Golden Hour (novel)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "The Birds on the Trees is a novel by Nina Bawden first published in 1970 about a middle-class English family whose 19-year-old son does not live up to his parents' expectations.", 'title': 'The Birds on the Trees'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Quando Eu Era Vivo (English: When I Was Alive ) is a 2014 Brazilian drama-thriller film directed by Marco Dutra, based on the novel "A Arte de Produzir Efeito Sem Causa" by Lourenço Mutarelli.', 'title': 'Quando Eu Era Vivo'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'John Vredenburgh Van Pelt, F.A.I.A., A.D.G.F., (February 24, 1874 – 1962) was an architectural historian, author, and American architect active in early to mid-twentieth-century New York City. He was a partner in Green & Van Pelt (1906), in Thompson & Van Pelt (1925), and Van Pelt, Hardy & Goubert (1928–1930). He had his offices in New York City and Patchogue, Long Island.', 'title': 'John Vredenburgh Van Pelt'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Jan van Steffeswert or alternatively Jan van Steffenswert or Jan van Stevensweert (born c. 1460 - died c. 1531) was a Flemish sculptor and woodcarver based in Maastricht. Contrary to the customs of the time, he signed almost all the works he produced using variously Jan Bieldesnider, Jan van Weerd or Jan van Steffeswert. To date, fourteen works have been positively identified as his. .', 'title': 'Jan van Steffeswert'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The "Watery Grave" EP was Graham Van Pelt\'s first release under his solo project Miracle Fortress. The self-released 5 song EP was recorded in 2005 at Friendship Cove, a recording studio/indie rock venue owned by Van Pelt and fellow friend Jack Dylan. The success of "Watery Grave" gained Van Pelt the attention of Montreal, Canada-based record label Secret City, which led to a collaboration that yielded his first full-length album "Five Roses".', 'title': 'Watery Grave (EP)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "Brad Alan Van Pelt (April 5, 1951 – February 17, 2009) was an American football linebacker who played 14 seasons in the National Football League (NFL). A two-time All-American (1971, 1972) and the 1972 Maxwell Award winner as college football's best player, he was drafted by the New York Giants, earning five Pro Bowl selections during his ten years with the team. He rounded out his career with the Los Angeles Raiders from 1984 to 1985 and the Cleveland Browns in 1986. Van Pelt is the father of former Denver Broncos and Houston Texans quarterback Bradlee Van Pelt.", 'title': 'Brad Van Pelt'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'David John Cawdell Irving (born 24 March 1938) is an English Holocaust denier and author who has written on the military and political history of World War II, with a focus on Nazi Germany. His works include "The Destruction of Dresden" (1963), "Hitler\'s War" (1977), "Churchill\'s War" (1987), and "Goebbels: Mastermind of the Third Reich" (1996). In his works, he argued that Hitler did not know of the extermination of Jews or, if he did, opposed it. Though Irving\'s revisionist views of World War II were never taken seriously by mainstream historians, he was once recognised for his knowledge of Nazi Germany and his ability to unearth new historical documents.', 'title': 'David Irving'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Wouter van Pelt (born 23 April 1968 in Alphen aan den Rijn) is a former Dutch field hockey player, who played 236 international matches for the Netherlands, in which he scored 21 goals. The defender made his debut for the Dutch on 27 March 1989 in a match against England. He played in the Dutch League for HDM and Breda. Van Pelt was a member of the Dutch national team that won the golden medal at the 1996 Summer Olympics in Atlanta, Georgia. Four years later, at the 2000 Summer Olympics in Sydney, the Dutch once again won the title, with Van Pelt on board. He stopped playing hockey at top level in 2005.', 'title': 'Wouter van Pelt'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Jan van Coninxloo or van Coninxlo, also known as Jan II or Jan the Younger, was born at Brussels in 1489 (?) , but nothing is known of the details of his career. His father, who bore the same Christian name, had another son, Pieter van Coninxloo: both were painters. The name is found written in a variety of ways — Ccninxlo, Conninxlo, Connixlo, Cooninxloo, Conixloo — and sometimes with the additional name of Schemier. The Brussels Gallery contains five works by Jan van Coninxlo : a triptych of the 'Life of St. Anne,' which bears on its right wing (representing the death of that saint) the signature 'Jan van Conixlo 1546'; the 'Birth of St. Nicholas,' and the 'Death of St. Nicholas,' both of which were formerly in a church in Louvain; 'Christ among the Doctors,' and the 'Marriage at Cana.' These were formerly attributed to Gilles van Coninxlo.", 'title': 'Jan van Coninxloo'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': "Robert Jan van Pelt (born 15 August 1955) is a Dutch author, architectural historian, professor at the University of Waterloo and University of Toronto in Ontario and a Holocaust scholar. One of the world's leading experts on Auschwitz, he regularly speaks on Holocaust related topics, through which he has come to address Holocaust denial. He was an expert witness in Deborah Lipstadt's successful defence in the civil libel suit brought against her by David Irving.", 'title': 'Robert Jan van Pelt'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Jean Marie Constantin Joseph "Jan" van Beers (27 March 1852\xa0– 17 November 1927) was a Belgian painter and illustrator, the son of the poet Jan van Beers. They are sometimes referred to as "Jan van Beers the elder" and "Jan van Beers the younger". In 1884, Jan Van Beers produced the pen-and-ink sketches for the "edition de luxe" of his father\'s poetry.', 'title': 'Jan van Beers (artist)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Linus van Pelt is a character in Charles M. Schulz\'s comic strip "Peanuts". The best friend of Charlie Brown, Linus is also the younger brother of Lucy van Pelt and older brother of Rerun van Pelt. He first appeared on September 19, 1952, but was not mentioned by name until three days later. He was first referred to two months earlier, on July 14. Linus spoke his first words in 1954, the same year he was shown with his security blanket.', 'title': 'Linus van Pelt'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'David C. Hardesty Jr. is an American lawyer and educator who was the 21st president of West Virginia University from 1995 to 2007. As an undergraduate student at West Virginia University, Hardesty was Student Body President, a member of Phi Kappa Psi, and a Rhodes Scholar. Hardesty earned J.D. from Harvard Law School in 1973, and a B.A. from Oxford University in 1969 which was redesignated an M.A. in 1983. He was a partner with Bowles, Rice, McDavid, Graff & Love from 1973 to 1995, and served as the Tax Commissioner of West Virginia from 1977 to 1980. Hardesty then began his twelve-year tenure as president of WVU. He is currently president emeritus and professor of law at West Virginia University.', 'title': 'David C. Hardesty Jr.'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Henry C. Groseclose was born on May 17, 1892. He lived in Ceres, Virginia for most of his life. Mr. Groseclose completed his junior college degree from Washington and Lee University in 1917. In his later years, he also received his bachelor’s degree, as well as his master’s degree, in agricultural education from Virginia Tech. While Mr. Groseclose was an agriculture teacher at the Virginia Polytechnic Institute, he, along with three other agriculture teachers, Walter Newman, Edmund Magill and Harry Sanders, decided to establish a club for the farm boys in the school. The organization was fired up in 1925. Groseclose named the organization the Future Farmers of Virginia, or FFV for short. The original meaning for the abbreviation FFV stood for the First Families of Virginia. The “first families” referred to the families of both George Washington and Thomas Jefferson. Referring to Washington and Jefferson, Groseclose once stated that, “The Future Farmers of America should follow the example of these great sons of early Virginia by using scientific knowledge, intelligence, and enthusiasm to the end that agriculture may again be known as the profession of the real aristocrat.” Groseclose wrote the by-laws, as well as the constitution that the FFV would be based on. In 1926, he also wrote, and brought into play, the formal ceremony that would take place as an organizational pattern to structure each meeting. Two years later, in 1928, the FFV became a nationwide organization. This developed the organization that is known today as the Future Farmers of America, or The National FFA Organization, or just FFA for short. The by-laws drawn up by Henry Groseclose became the foundation of the newly national organization. Also, the formal ceremony that Groseclose developed was taken on by the FFA as a national ritual that is still used today. Groseclose was a seventh degree Grange member, and he was also involved with the Masons, so it was no surprise when he developed levels of memberships for the FFV, which transferred through to the FFA, that were similar to the three leveled membership structure that the Masons uses. These three levels included the Greenhand, the Virginia Farmer and the Virginia Planter. While the official emblem of the National FFA Organization was being drawn, Groseclose’s original emblem, which he hand drew himself, was highly considered and ended up playing a part in the emblem that is still the emblem of the National FFA Organization today. The part of the emblem that was from Mr. Groseclose’s original drawing included a background setting of a half plowed wheat field with an owl perched upon a spade of wheat in front of the field. Henry Groseclose served as the Executive Secretary of the National FFA Organization for two years between 1928 and 1930. During his office of Executive Secretary, he announced at the national convention of 1930 that he had written, and would be releasing, an official FFA manual, which outlined the organization, procedures and structures of the National FFA Organization. Mr. Groseclose also served as the Treasurer of the National FFA Organization for 11 years, between 1930 and 1941. In September 1925, Henry Groseclose set his expectations for the members of the FFV, and the purpose of the establishment of the Future Farmers of Virginia was by saying, "In my opinion the farm boys of Virginia who are enrolled in vocational agriculture are equal to any other group of boys in the state. But somehow the boys themselves seem to have a feeling of inferiority. Especially is this true when the farm boy goes to the city and has to compete with his city cousin. This condition should not exist. I believe that a strong organization of our boys in agriculture would help them to overcome this handicap. Let\'s form an organization that will give them a greater opportunity for self-expression and for the development of leadership. In this way they will develop confidence in their own ability and pride in the fact that they are farm boys." Mr. Henry C. Groseclose died on June 4 of 1950. In 2002, the Department of Historic Resources established a marker in Mr. Groseclose’s honor. It is Marker number KC-5 and it is displayed in Bland County of Ceres, Virginia.', 'title': 'Henry C. Groseclose'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Virginia Tech Foundation (VTF) is a 501(c)(3) nonprofit nonstock corporation established in 1948 to receive, manage, and disburse private gifts in support of Virginia Polytechnic Institute and State University programs. The purpose of the foundation is to manage private funds given for the support of the university, and to foster and promote the growth, progress and general welfare of the university. The Virginia Tech Foundation is governed by a 35-member Board of Directors and 4 ex-officio positions: the President of Virginia Tech, the Rector of the Board of Visitors, the President of the VT Alumni Association, and the President of the Virginia Tech Athletic Fund.', 'title': 'Virginia Tech Foundation'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'John Lee Buchanan (June 19, 1831 – January 19, 1922) was the second president of Virginia Tech (then Virginia Agricultural and Mechanical College). Buchanan was born in Rich Valley, Smyth County, Virginia. Received an A.B. in 1856 and an M.A. in 1860, both from Emory and Henry College where he was a member of the faculty until 1878 with the exception of the Civil War years when he served the Confederate States in the mining department. In 1879 he became the Latin chair at Vanderbilt University and later served as president of Emory and Henry College before being appointed VAMC president at age 48. After being removed from VAMC presidency for the second time in 1881, he began teaching at Martha Washington College in Abingdon, Virginia, later becoming president there. In 1884 he served on a state committee that established the State Normal Female School in Farmville (now Longwood University). From 1885 to 1889 he served as state superintendent of public instruction (hence was ex officio member of the VAMC Board of Visitors). He began teaching at Randolph-Macon College in 1889, later becoming president. He resigned the presidency of Randolph-Macon in 1894 to assume presidency of what was then Arkansas Industrial University before he renamed it to University of Arkansas and where he remained until retiring in 1902. Died Jan. 19, 1922, in Rich Valley, Virginia, at age 90.', 'title': 'John Lee Buchanan'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The University of Virginia (U.Va. or UVA), frequently referred to simply as Virginia, is a public research university and the flagship for the Commonwealth of Virginia. Founded in 1819 by Declaration of Independence author Thomas Jefferson, UVA is known for its historic foundations, student-run honor code, and secret societies.', 'title': 'University of Virginia'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The University of Washington (commonly referred to as UW, simply Washington, or informally "U-Dub") is a large, public flagship research university in Seattle, Washington, established in 1861.', 'title': 'University of Washington'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'The Jefferson Memorial is a presidential memorial in Washington, D.C., dedicated to Thomas Jefferson (1743–1826), one of the most important of the American Founding Fathers as the main drafter and writer of the Declaration of Independence, member of the Continental Congress, governor of the newly independent Commonwealth of Virginia, American minister to King Louis XVI and the Kingdom of France, first U.S. Secretary of State under the first President George Washington, the second Vice President of the United States under second President John Adams, and also the third President (1801–1809), as well as being the founder of the University of Virginia at Charlottesville, Virginia.', 'title': 'Jefferson Memorial'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Michael Garrison is the former president of West Virginia University, succeeded by C. Peter Magrath on August 1, 2008. A graduate of the WVU class of 1992 and earned a J.D. at WVU in 1996 after attending St. Anne's College, Oxford University on a Rotary Scholarship. He lectured as an adjunct professor in West Virginia University's department of Political Science in the years preceding his appointment as president. Garrison had been managing member of Spilman Thomas & Battle pllc in Morgantown. In 2003, Garrison was awarded a Toll Fellowship from the Council of State Governments following his tenure as Chief of Staff to West Virginia Governor Bob Wise from 2001-2003. He served as Cabinet Secretary in the West Virginia Department of Tax and Revenue until 2001. In 2007, Garrison was selected as West Virginia University's twenty-second president.", 'title': 'Michael Garrison (politician)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Edwin Anderson Alderman (May 15, 1861\xa0– April 30, 1931) served as the President of three universities. The University of Virginia's Alderman Library is named after him, as is Edwin A. Alderman Elementary School in Wilmington and Alderman dorm at the University of North Carolina at Chapel Hill. Alderman was the key leader in higher education in Virginia during the Progressive Era as president of the University of Virginia, 1904-31. His goal was the transformation of the Southern university into a force for state service and intellectual leadership and educational utility. Alderman successfully professionalized and modernized Virginia's system of higher education. He promoted international standards of scholarship, and a statewide network of extension services. Joined by other college presidents, he promoted the Virginia Education Commission, created in 1910. Alderman's crusade encountered some resistance from traditionalists and never challenged the Jim Crow system of segregated schooling.", 'title': 'Edwin Alderman'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The Washington Papers, also known as The Papers of George Washington"," is a project dedicated to the publication of comprehensive letterpress and digital editions of George and Martha Washington’s papers. Founded at the University of Virginia in 1968 as the Papers of George Washington, the Washington Papers is an expansive project that includes the papers and documents of George Washington as well as of individuals close to him. The Washington Papers aims to place Washington in a larger context and to bring individuals, such as Martha Washington and Washington family members, into sharper focus. The project is currently headed by editor-in-chief and director Edward G. Lengel and is the largest collection of its type. The project is funded in part by the National Endowment for the Humanities, the National Historical Publications and Records Commission, the Packard Humanities Institute, the Mount Vernon Ladies\' Association, the University of Virginia, the Florence Gould Foundation, and other private donors.', 'title': 'The Washington Papers'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Goober Pyle is a fictional character in the American TV sitcom "The Andy Griffith Show" and its later sequel series "Mayberry RFD". He was played by George Lindsey. Lindsey first read for the part of Gomer Pyle, Goober\'s cousin, which went to actor-singer Jim Nabors. The two actors had similar backgrounds; Lindsey was from Jasper, Alabama, while Nabors was from Sylacauga, Alabama.', 'title': 'Goober Pyle'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Sheriff Andrew "Andy" Jackson Taylor and in earlier episodes as Cousin Andy by Barney Fife is the major character on "The Andy Griffith Show", an American sitcom which aired on CBS, (1960–1968). He also appears in the "Gomer Pyle, U.S.M.C." episode "Opie Joins the Marines", made a cameo appearance in the USMC episode "Gomer Goes Home," five episodes of "Mayberry R.F.D." (1968–1971) and the reunion telemovie "Return to Mayberry" (1986). The character made his initial appearance in an episode of "The Danny Thomas Show" entitled "Danny Meets Andy Griffith." In the CBS special "The Andy Griffith - Don Knotts - Jim Nabors Show" (1965), Andy and Barney are featured in a musical sketch about their friendship and recreate some classic moments between the characters. Andy Griffith, as Sheriff Taylor, also has a brief comedy cameo in "Rowan and Martin at the Movies" (1969), a PSA short subject promoting the purchase of U.S. Savings Bonds. Andy Taylor appeared in all 249 episodes of "The Andy Griffith Show" and was played by comedian and actor Andy Griffith.', 'title': 'Andy Taylor (The Andy Griffith Show)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Gomers are a Madison, Wisconsin based comedy rock/experimental music/progressive rock band. Former Madison Mayors Dave Cieslewicz and Sue Baumann both proclaimed February 1 as "Gomer Day" in Madison. Their name was taken from Gomer Pyle.', 'title': 'The Gomers'}
 {'idx': 3, 'is_supporting': True, 'paragraph_text': 'The ABC Comedy Hour was an American television variety series that aired on ABC in 1972. Seven of the 13 episodes featured a guest host and a team of comedy impressionists known as The Kopykats (Rich Little, Frank Gorshin, Joe Baker, Marilyn Michaels, George Kirby, and Fred Travalena, with single appearances by Charlie Callas, Will Jordan, and Peter Goodwright). Guest hosts included Steve Lawrence, Orson Welles, Ed Sullivan, Raymond Burr, Robert Young, Debbie Reynolds and Tony Curtis. The remaining six episodes were variety specials and included two Friars Club roasts and a revival of the musical "Hellzapoppin\'" starring Jack Cassidy and Ronnie Schell.', 'title': 'The ABC Comedy Hour'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Claude Wilson Osteen (born August 9, 1939), nicknamed "Gomer" because of his resemblance to Gomer Pyle, is a former Major League Baseball left-handed pitcher. He pitched for six different teams: the Cincinnati Redlegs/Reds (1957–61), Washington Senators (1961–64), Los Angeles Dodgers (1965–73), Houston Astros (1974), St. Louis Cardinals (1974), and Chicago White Sox (1975).', 'title': 'Claude Osteen'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Ronald Ralph "Ronnie" Schell (born December 23, 1931) is an American actor, stand-up comedian, and voice actor. He appeared on May 28, 1959, episode of the TV quiz program "You Bet Your Life", hosted by Groucho Marx. Schell demonstrated a comic barrage of beatnik jive talk. As a stand-up comedian, he first developed his act at the world-famous hungry-i nightclub in San Francisco, California. Schell is probably best known in his 1960s television role as Duke Slater in "Gomer Pyle, U.S.M.C."', 'title': 'Ronnie Schell'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Buck Young (April 12, 1920 – February 9, 2000) was an American actor who played the role as Sergeant Whipple on the "Gomer Pyle, U.S.M.C." TV series, and Deputy Joe Watson on "The Andy Griffith Show".', 'title': 'Buck Young'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'James Thurston Nabors (born June 12, 1930) is a retired American actor, singer, and comedian. Born and raised in Sylacauga, Alabama, Nabors moved to southern California because of his asthma. While working at a Santa Monica nightclub, The Horn, he was discovered by Andy Griffith and later joined "The Andy Griffith Show," playing Gomer Pyle. Nabors, Betty Lynn, Elinor Donahue, and Ron Howard are the last surviving regular cast members from that series. The character proved popular, and Nabors was given his own spin-off show, "Gomer Pyle, U.S.M.C.."', 'title': 'Jim Nabors'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Gomer Pyle, U.S.M.C. is an American television situation comedy that was originally broadcast from 1964 to 1969 on the CBS network. It focused on Gomer Pyle, a naïve but good-hearted private in the United States Marine Corps who served in a non-combat role while stationed stateside. The plots of the episodes often grew out of the contentious relationship between Pyle and his stern NCO, Sergeant Carter.', 'title': 'List of Gomer Pyle, U.S.M.C. characters'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Gomer Pyle, U.S.M.C." is an American situation comedy created by Aaron Ruben that originally aired on CBS from September 25, 1964, to May 2, 1969. The series was a spinoff of "The Andy Griffith Show", and the pilot episode was introduced as the final fourth season episode which aired on May 18, 1964. The show ran for five seasons, with a total of 150 half-hour episodes. Despite the series\' positive reception (the show remained in the Top 10 Nielsen ratings for all five seasons), Nabors quit because he desired to move to something else, \'reach for another rung on the ladder, either up or down\'. In 2006, CBS began releasing the show on DVD; the last season was released in November 2008.', 'title': 'List of Gomer Pyle, U.S.M.C. episodes'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "Chapman University's Dale E. Fowler School of Law, commonly referred to as Chapman University School of Law or Chapman Law School, is a private, non-profit law school located in Orange, California. The school offers the Juris Doctor degree (JD), combined programs offering a JD/MBA and JD/MFA in Film & Television Producing, and multiple LL.M. degree options. The school also offers emphasis options in Business Law, Criminal Law, Entertainment Law, Environmental Law, International Law, Trial Advocacy, and Taxation. Currently, the school has 74 full- and part-time faculty members and a law library with holdings in excess of 290,000 volumes and volume equivalents.", 'title': 'Chapman University School of Law'}
 {'idx': 1, 'is_supporting': True, 'paragraph_text': "Vernon Lomax Smith (born January 1, 1927) is an American professor of economics at Chapman University's Argyros School of Business and Economics and School of Law in Orange, California, formerly a research scholar at George Mason University Interdisciplinary Center for Economic Science, and a Fellow of the Mercatus Center, all in Arlington, Virginia.", 'title': 'Vernon L. Smith'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': "Elizabeth Helen Blackburn, AC, FRS, FAA, FRSN (born 26 November 1948) is an Australian-American Nobel laureate who is currently the President of the Salk Institute for Biological Studies. Previously she was a biological researcher at the University of California, San Francisco, who studied the telomere, a structure at the end of chromosomes that protects the chromosome. Blackburn co-discovered telomerase, the enzyme that replenishes the telomere. For this work, she was awarded the 2009 Nobel Prize in Physiology or Medicine, sharing it with Carol W. Greider and Jack W. Szostak, becoming the only Tasmanian-born Nobel laureate. She also worked in medical ethics, and was controversially dismissed from the Bush Administration's President's Council on Bioethics.", 'title': 'Elizabeth Blackburn'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'The Department of Chemistry at the University of Cambridge is the chemistry department of the University of Cambridge. It was formed from a merger in the early 1980s of two separate departments that had moved into the Lensfield Road building decades earlier: the Department of Physical Chemistry (originally led by Professor Ronald Norrish FRS, Nobel Laureate; the department was previously located near the Old Cavendish in Free Street - see photo) and the Department of Chemistry (that included theoretical chemistry and which was led by Lord Alexander R. Todd FRS, Nobel Laureate) respectively. Research interests in the department cover a broad of chemistry ranging from molecular biology to geophysics. The department is located on the Lensfield Road, next to the Panton Arms on the South side of Cambridge. s of 2015 the department is home to around 200 postdoctoral research staff, over 250 postgraduate students, around sixty academic staff.', 'title': 'Department of Chemistry, University of Cambridge'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'François Baron Englert (] ; born 6 November 1932) is a Belgian theoretical physicist and 2013 Nobel prize laureate (shared with Peter Higgs). He is Professor emeritus at the Université libre de Bruxelles (ULB) where he is member of the Service de Physique Théorique. He is also a Sackler Professor by Special Appointment in the School of Physics and Astronomy at Tel Aviv University and a member of the Institute for Quantum Studies at Chapman University in California. He was awarded the 2010 J.\xa0J.\xa0Sakurai Prize for Theoretical Particle Physics (with Gerry Guralnik, C.\xa0R.\xa0Hagen, Tom Kibble, Peter Higgs, and Robert Brout), the Wolf Prize in Physics in 2004 (with Brout and Higgs) and the High Energy and Particle Prize of the European Physical Society (with Brout and Higgs) in 1997 for the mechanism which unifies short and long range interactions by generating massive gauge vector bosons. He has made contributions in statistical physics, quantum field theory, cosmology, string theory and supergravity. He is the recipient of the 2013 Prince of Asturias Award in technical and scientific research, together with Peter Higgs and the CERN.', 'title': 'François Englert'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The Center for American War Letters was established in 2013 when historian Andrew Carroll donated more than 100,000 war letters to Chapman University. The Center for American War Letters(CAWL) is housed in the Leatherby Libraries building at Chapman University in Orange, California. Every American conflict is represented in the collections at CAWL, including more than 40 linear feet of correspondence from World War II. Scholars and the public can visit the Center and browse its holdings by visiting the Center during business hours. There are also regular exhibits at CAWL featuring the letters and other war ephemera.', 'title': 'Center for American War Letters'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Chapman University is a private, non-profit university located in Orange, California, United States. It is affiliated with the Christian Church (Disciples of Christ). Chapman University encompasses ten schools and colleges: Dodge College of Film and Media Arts, Wilkinson College of Humanities and Social Sciences, Argyros School of Business and Economics, the School of Communication, Schmid College of Science and Technology, College of Performing Arts, Dale E. Fowler School of Law, College of Educational Studies, the School of Pharmacy, and the Crean College of Health and Behavioral Sciences. Chapman also operates Brandman University as a separate, fully accredited university within the Chapman University System.', 'title': 'Chapman University'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Thomas John Campbell (born August 14, 1952) is an American academic, educator and former politician. He is Professor of Law at the Dale E. Fowler School of Law, and a Professor of Economics at the George Argyros School of Business and Economics, at Chapman University, in Orange, California. He was Dean of Chapman University School of Law from 2011-16, a former five-term Republican United States Congressman from California's 12th and 15th districts, former member of the California State Senate, a former professor at Stanford Law School, former dean of the Haas School of Business, and former professor of business administration at the University of California, Berkeley. In 2000 he retired from his House seat to run for the U.S. Senate but lost decisively to incumbent Dianne Feinstein. He served as the Director of Finance for the State of California from 2004 to 2005. On June 8, 2010, he lost his third bid for the United States Senate, and second for the seat held by Democrat Barbara Boxer, losing the Republican nomination to Carly Fiorina.", 'title': 'Tom Campbell (California politician)'}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'The Journal of Behavioral Finance is a quarterly peer-reviewed academic journal that covers research related to the field of behavioral finance. It was established in 2000 as "The Journal of Psychology and Financial Markets". The founding Board of Editors were Brian Bruce, David Dreman, Paul Slovic, Nobel Laureate Vernon Smith and Arnold Wood. The editor-in-chief was Gunduz Caginalp (2000-2005), Brian Bruce (Hillcrest Asset Management) is the current editor.', 'title': 'Journal of Behavioral Finance'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Paul Delos Boyer (born July 31, 1918) is an American biochemist, analytical chemist, and a professor of chemistry at University of California Los Angeles (UCLA) . He shared the 1997 Nobel Prize in Chemistry for research on the "enzymatic mechanism underlying the biosynthesis of adenosine triphosphate (ATP)" (ATP synthase) with John E. Walker, making Boyer the only Utah-born Nobel laureate; the remainder of the Prize in that year was awarded to Danish chemist Jens Christian Skou for his discovery of the Na+/K+-ATPase. He is the oldest living Nobel laureate at age 99 .', 'title': 'Paul D. Boyer'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Showtime, Storytime is a video release, released as a double Blu-ray, DVD and CD from Finnish symphonic metal band Nightwish. Nuclear Blast recorded their live performance at Wacken Open Air in Wacken, Germany on August 3, 2013. "Showtime, Storytime" is the first Nightwish production to feature Floor Jansen on vocals. She initially replaced previous vocalist Anette Olzon during their North America tour leg, and on October 9, 2013, it was revealed that she would become an official band member, along with Troy Donockley. The running time of the concert is 1 hour and 38 minutes. The album also contains a 120-minute documentary about the first days of Jansen in the band, still as an only live member, and her process of adaptation in the band, called "Please Learn the Setlist in 48 Hours".', 'title': 'Showtime, Storytime'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"Wish I Had An Angel" is the eleventh single for Finnish symphonic metal band Nightwish, the second from their fifth album "Once". The song features vocals by then-vocalist Tarja Turunen and bassist Marco Hietala. The song was still performed live after Turunen\'s departure with Anette Olzon, before her departure, and current vocalist Floor Jansen afterwards.', 'title': 'Wish I Had an Angel'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Hitman (Tommy Monaghan) is a fictional character, a superpowered hitman in the DC Comics Universe. The character was created by Garth Ennis and John McCrea and first appeared in "The Demon Annual" #2 and then received his own series by Ennis and McCrea lasting 61 issues.', 'title': 'Hitman (DC Comics)'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The discography of the Finnish symphonic metal band Nightwish consists of eight studio albums, one extended play, four live albums, seven compilations, thirteen music videos and twenty one singles. The band was formed in 1996 by songwriter and keyboardist Tuomas Holopainen, guitarist Emppu Vuorinen, and former vocalist Tarja Turunen; Nightwish's current line-up has six members although Turunen has been replaced by Anette Olzon, and the original bassist, Sami Vänskä, has been replaced by Marco Hietala, who also took over the male vocalist part. Olzon left the band in 2012 and was replaced by Floor Jansen.", 'title': 'Nightwish discography'}
