 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'John McCrea (born June 25, 1964) is an American singer and musician. He is a founding member of the band Cake. He is the vocalist and primary lyricist for the band, in addition to playing rhythm acoustic guitar, vibraslap, and piano. He also programs drums and does mixing work while he and the rest of the band have produced all of their albums.', 'title': 'John McCrea (musician)'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Endless Forms Most Beautiful is the eighth album by Finnish symphonic power metal band Nightwish. It was released on March 27, 2015 in Argentina and most of Europe, March 30 in the UK, and March 31 in the US. The album is the band's first featuring singer Floor Jansen and the first with Troy Donockley as a full-time member. It was recorded without drummer Jukka Nevalainen, who took a break from the band due to severe insomnia. Drumming was by Kai Hahto of Wintersun and Swallow the Sun. The album includes only five Nightwish members, despite its being their first album release as a sextet.", 'title': 'Endless Forms Most Beautiful (album)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Cake (stylized CAKE) is an American alternative rock band from Sacramento, California. Consisting of singer John McCrea, trumpeter Vince DiFiore, guitarist Xan McCurdy, bassist Gabe Nelson and drummer Paulo Baldi, the band has been noted for McCrea's sarcastic lyrics and monotone vocals, DiFiore's trumpet parts, and their wide-ranging musical influences, including country music, Mariachi, rock, funk, Iranian folk music and hip hop.", 'title': 'Cake (band)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Decipher is the second album by Dutch symphonic metal band After Forever, released in 2001. In this album, the band make use of live classical instruments and a complete choir to back up the soprano voice of lead singer Floor Jansen. Thrown in the mix are also a duet of soprano and tenor voices in "Imperfect Tenses" and the recording of the late Israeli PM Yizhak Rabin voice during the Peace treaty signing ceremony on October 26, 1994 on "Forlorn Hope". This is the last After Forever album with guitarist and founder Mark Jansen, who left the band soon after its release.', 'title': 'Decipher (After Forever album)'}]

[{'idx': 0, 'is_supporting': True, 'paragraph_text': 'Córdoba (] ) is a city in the geographical center of Argentina, in the foothills of the Sierras Chicas on the Suquía River, about 700 km northwest of the Autonomous City of Buenos Aires. It is the capital of Córdoba Province and the second most populous city in Argentina after Buenos Aires, with about 1,330,023 inhabitants according to the 2010 census. It was founded on 6 July 1573 by Jerónimo Luis de Cabrera, who named it after Córdoba, Spain. It was one of the first Spanish colonial capitals of the region that is now Argentina (the oldest city is Santiago del Estero, founded in 1553). The National University of Córdoba is the oldest university of the country and the second to be inaugurated in Latin America. It was founded in 1613 by the Jesuit Order. Because of this, Córdoba earned the nickname "La Docta" (roughly translated, "the learned one").', 'title': 'Córdoba, Argentina'}
