[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Operation Autonomous was a clandestine operation carried out on the territory of Romania by the Special Operations Executive (SOE) set up by Churchill for the duration of the war to assist local Resistance movements.', 'title': 'Operation Autonomous'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': "A clandestine operation is an intelligence or military operation carried out in such a way that the operation goes unnoticed by the general population or specific 'enemy' forces.", 'title': 'Clandestine operation'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Counter-Guerrilla (Turkish: "Kontrgerilla" ) is the Turkish branch of Operation Gladio, a clandestine stay-behind anti-communist initiative backed by the United States as an expression of the Truman Doctrine. The founding goal of the operation was to erect a guerrilla force capable of countering a possible Soviet invasion. The goal was soon expanded to subverting communism in Turkey.', 'title': 'Counter-Guerrilla'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Operation Jedburgh was a clandestine operation during World War II, in which personnel of the British Special Operations Executive, the U.S. Office of Strategic Services, the Free French Bureau Central de Renseignements et d\'Action ("Intelligence and operations central bureau") and the Dutch and Belgian Armies were dropped by parachute into occupied France, the Netherlands and Belgium to conduct sabotage and guerrilla warfare, and to lead the local resistance forces in actions against the Germans.', 'title': 'Operation Jedburgh'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Stealing a Nation is a 2004 Granada Television documentary about the British–American clandestine operation that saw the expulsion of the native Chagossian population of Diego Garcia and neighbouring islands. More than 2,000 people were exiled to Mauritius between 1967 and 1973, so that Diego Garcia could become a United States airbase "(see depopulation of Chagossians from the Chagos Archipelago)". The film contains a series of interviews with native Chagossians, who have been deprived of their right of return and forced to live in abject poverty. "Stealing a Nation" was written and directed by John Pilger, and produced and directed by Christopher Martin; reconstruction footage was directed by Sean Crotty.', 'title': 'Stealing a Nation'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'The First Battle of Kiev was the German name for the operation that resulted in a very large encirclement of Soviet troops in the vicinity of Kiev during World War II. This encirclement is considered the largest encirclement in the history of warfare (by number of troops). The operation ran from 7 August to 26 September 1941 as part of Operation Barbarossa, the Axis invasion of the Soviet Union. In Soviet military history, it is referred to as the Kiev Strategic Defensive Operation, with somewhat different dating of 7 July – 26 September 1941.', 'title': 'Battle of Kiev (1941)'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'The Years of Lead were a political phenomenon related to the Cold War that was characterized by left- and right-wing terrorism and the strategy of tension, beginning in Italy and later spreading to the rest of Europe. In Italy terrorist groups include the Red Brigades and Ordine Nuovo, in Germany there was the Red Army Faction and in France there was "Action directe". In Belgium, the "années de plomb" or "Bloody Eighties", refers to the Brabant massacres which resulted in 28 deaths. The far-right movement Westland New Post (WNP) has been suspected in this campaign. Attacks by the Communist Combatant Cells, a short-lived group, killed two. Many of the right-wing groups involved have been linked to Operation Gladio. The liberation of James L. Dozier signaled the end of the years of lead.', 'title': 'Years of Lead'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'Operation Gladio is the codename for a clandestine North Atlantic Treaty Organisation (NATO) "stay-behind" operation in Italy during the Cold War. Its purpose was to prepare for, and implement, armed resistance in the event of a Warsaw Pact invasion and conquest. The name "Gladio" is the Italian form of "gladius", a type of Roman shortsword. Although Gladio specifically refers to the Italian branch of the NATO stay-behind organizations, "Operation Gladio" is used as an informal name for all of them. Stay-behind operations were prepared in many NATO member countries, and some neutral countries.', 'title': 'Operation Gladio'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Operation Kentucky was a multi-Battalion operation conducted by the United States Marine Corps in the area south of the DMZ in Quang Tri Province. This was another operation to secure the Con Thien area from the North Vietnamese Army (NVA). The operation ran from November 1, 1967 until February 28, 1969.', 'title': 'Operation Kentucky'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Turkey–United States relations in the post-World War II period evolved from the Second Cairo Conference in December 1943 and Turkey\'s entrance into World War II on the side of the Allies in February 1945, as a result of which Turkey became a charter member of the United Nations. Difficulties faced by Greece after the war in quelling a communist rebellion, along with demands by the Soviet Union for military bases in the Turkish Straits, prompted the United States to declare the Truman Doctrine in 1947. The doctrine enunciated American intentions to guarantee the security of Turkey and Greece, and resulted in significant U.S. military and economic support. This support manifested in the establishment of a clandestine stay-behind army, denoted the "Counter-Guerrilla", under Operation Gladio. After participating with United Nations forces in the Korean War, Turkey joined the North Atlantic Treaty Organization in 1952.', 'title': 'Turkey–United States relations'}]

