[{'idx': 0, 'is_supporting': True, 'paragraph_text': "Snoop Dogg's Doggystyle is a mixed hardcore pornography and hip-hop music video featuring the music of rapper Snoop Dogg and presented by him. It was released in 2001. It was the first hardcore video ever listed on the Billboard music video sales chart. Because of its huge success, it started a trend where rappers are put into the mainstream of the porn industry by hosting X-rated movies. Many films of the genre followed, starring Necro, Mystikal, Too Short, Ice-T and Yukmouth. It also allowed Hustler to expand its boundaries by launching new subsidiaries for their recently formed fashion line and CD label. The scenes were shot at Snoop Dogg's house in Claremont, California. Snoop Dogg himself however, does not appear nude or perform any explicit acts.", 'title': "Snoop Dogg's Doggystyle"}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': '"Snoop Dogg (What\'s My Name II)" is the follow-up for one of the first singles released by rapper Snoop Dogg, "Who Am I? (What\'s My Name?) ." It was also the only CD single released from his fifth album, "Tha Last Meal". The music video is directed by Chris Robinson. It was produced by Timbaland and briefly features Dr. Dre, who is sat on a couch portrayed as a pimp with Snoop Dogg to his left. Nate Dogg and Lady of Rage provide vocals in the chorus.', 'title': "Snoop Dogg (What's My Name Pt. 2)"}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Coolaid is the fourteenth studio album by American West Coast hip hop recording artist Snoop Dogg. It was released on July 1, 2016, by Doggystyle Records and eOne Music. Recording sessions for the album took place during 2015 to 2016 at the Doggystyle Studios Records, in Diamond Bar, California. The production on the album was handled by Snoop Dogg and other record producers, including Just Blaze, Swizz Beatz and Timbaland. Snoop Dogg also enlisted a variety of guest vocalists such as Too $hort, Swizz Beatz, Jeremih, Wiz Khalifa, Trick Trick, E-40, Jazze Pha, Suga Free and October London, among others.', 'title': 'Coolaid'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Diary of a G is the eleventh studio album from rapper Mr. Capone-E released on August 25, 2009 through his own record label Hi-Power Entertainment. Mr. Capone-E produced Diary of a G with co-producer Fingazz. Diary of a G is a two-disc set with the album plus the DVD; the DVD shows all the steps Mr. Capone-E takes to make the album. The DVD features artists such as Lil Eazy-E, Lil Rob, Snoop Dogg, The Game, Mr. Criminal, Prima J, (Boxer) Amrkhan, and more. The album features artist\'s such as Snoop Dogg, Mr. Criminal, Fingazz, The Game, Glasses Malone, Birdman, and more. Including the single "Light My Fire" featuring Snoop Dogg & Fingazz.', 'title': 'Diary of a G'}
 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Meech Wells (born Cecil D. Womack, Jr.) is a music producer from the United States. He works primarily on hip hop music, and has produced or co-produced for artists Snoop Dogg and Shaquille O\'Neal. Wells is also the son of Motown singer Mary Wells and musician/songwriter, Cecil Womack. Being the son of Motown legend Mary Wells may have helped jumpstart Meech Wells\' career, but the West Coast rap producer quickly proved his talent and eventually aligned himself with Snoop Dogg, another relationship that definitely didn\'t hurt his career. Before being Snoop\'s producer of choice during the late 1990s and early 2000s, Wells began his career as part of a funk band called Trey Lewd that also featured Tracey Lewis, George Clinton\'s son; this provided him with the opportunity to work with Clinton himself. By 1993, Wells found himself working alongside producer/rapper Def Jef; the two\'s production on Shaquille O\'Neil\'s "I Got Skillz" (a surprise hit single) won them instant credentials. Throughout the mid-\'90s, he continued to hone his craft, working on a number of remix projects before eventually being introduced to Snoop through a friend. Before long, the two were working together as a potent duo, beginning with "Still a G Thang," one of the better songs on Snoop\'s Da Game Is to Be Sold, Not to Be Told. Wells produced a few No Limit songs featuring Snoop—Tru\'s "It\'s a Beautiful Thang," Silkk the Shocker\'s "Get It Up"—before playing a major role in bringing a West Coast sound to Snoop\'s Top Dogg album in 1999: "In Love With a Thug," "Better Days," "Gangsta Ride," among others. In 2000 he reprised his role as one of Snoop\'s producers of choice, producing tracks for Tha Eastsidaz\' self-titled debut and Doggy\'s Angels\' Pleezbalevit, as well as Snoop\'s own Tha Last Meal ("Go Away," "Issues").', 'title': 'Meech Wells'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Stanley Harris Jr. (born in Santa Ana, California, U.S.) is a music producer, rapper and singer in Los Angeles, California. He records under the stage name Quaze or Quazedelic. He received his big break into the music industry when rapper Snoop Dogg signed him to Doggystyle Records in 2001. He is most recognized for his funk music style production. His first major release with the Doggystyle Records crew was on the soundtrack of Undercover Brother, where he produced the single, Give Up the Funk. The song featured Snoop Dogg, Bootsy Collins, Fred Wesley, Kokane and Quazedelic. Later he went on to work with many other Hip-Hop and R&B artists like Angie Stone, Baby Bash, G-Unit, Dub C, Redman, Suga Free and Goldie Loc from the Eastsidaz.', 'title': 'Quazedelic'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Doggystyle is the debut studio album by American rapper Snoop Doggy Dogg. It was released on November 23, 1993, by Death Row Records and Interscope Records. The album was recorded and produced following Snoop\'s appearances on Dr. Dre\'s debut solo album "The Chronic" (1992), to which Snoop contributed significantly. The West Coast style in hip-hop that he developed from Dre\'s first album continued on "Doggystyle". Critics have praised Snoop Doggy Dogg for the lyrical "realism" that he delivers on the album and for his distinctive vocal flow. Despite some mixed criticism of the album initially upon its release, "Doggystyle" earned recognition from many music critics as one of the most significant albums of the 1990s, as well as one of the most important hip-hop albums ever released. Much like "The Chronic", the distinctive sounds of "Doggystyle" helped introduce the hip-hop subgenre of g-funk to a mainstream audience, bringing forward West Coast hip hop as a dominant force in the early-1990s.', 'title': 'Doggystyle'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "Dead Man Walkin' is a compilation album released by Death Row Records on October 31, 2000, composed of archived Snoop Dogg recordings but was not authorized by Snoop Dogg, nor recognized on the discography on his website. Snoop Dogg was an artist on Death Row from 1992 to 1998, when he left the label following labelmate Dr. Dre's departure and the death of Tupac Shakur. The split between Snoop Dogg and Death Row head Suge Knight was less than amicable, and the title of this release was an unfriendly warning from Knight to Snoop Dogg, who had spoken out against the imposing Knight in several interviews and on record as well. According to SoundScan (2005), it has sold 220,478 copies. A music video was released for Head Doctor.", 'title': "Dead Man Walkin'"}
 {'idx': 8, 'is_supporting': True, 'paragraph_text': 'Snoop Dogg\'s Hustlaz: Diary of a Pimp is a mixed hardcore pornography and hip hop music video featuring the music of rapper Snoop Dogg, produced by Hustler Video. The video was also directed, co-produced and presented by Snoop, although he does not feature in any sex scenes. In the films credits, Snoop is listed under the moniker "Snoop Scorsese". The movie was released in 2002, a year after Snoop Dogg set the trend of mixed hip hop porn movies with "Snoop Dogg\'s Doggystyle".', 'title': "Snoop Dogg's Hustlaz: Diary of a Pimp"}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': '"Game Don\'t Wait" was the second single released from Warren G\'s third album, "I Want It All". The remix of the song, which was the version released as a single was produced by Warren G\'s stepbrother Dr. Dre and featured fellow 213 members, Nate Dogg and Snoop Dogg, as well as Xzibit. It peaked at 58 on the Hot R&B/Hip-Hop Singles & Tracks. The original song was produced by Warren G and featured Snoop Dogg and Nate Dogg, but Xzibit was exclusive to the remix.', 'title': "Game Don't Wait"}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Paul Bittner (born November 4, 1996) is an American professional ice hockey Winger who is currently assigned to the Cleveland Monsters of the American Hockey League (AHL) as a prospect of the Columbus Blue Jackets in the National Hockey League (NHL). Bittner has played major junior hockey with the Portland Winterhawks of the Western Hockey League (WHL). Bittner was rated as a top prospect who was widely projected to be a first round selection in the 2015 NHL Entry Draft. He was, however, selected 38th overall, in the second round by the Blue Jackets in the 2015 NHL Entry Draft.', 'title': 'Paul Bittner'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Ivan Dmitrievich Barbashev (Russian: Иван Дмитриевич Барбашёв ; born 14 December 1995) is a Russian professional ice hockey forward. He is currently playing as a prospect to the St. Louis Blues of the National Hockey League (NHL). Barbashev was selected by the Blues in the second round (33rd overall) of the 2014 NHL Entry Draft. Born and raised in Russia, Barbashev started playing hockey there before moving to North America in 2012, where he joined the Moncton Wildcats of the Quebec Major Junior Hockey League (QMJHL). He spent three seasons in the QMJHL before making his professional debut in the AHL, and made his NHL debut in 2017. Internationally Barbashev has played for the Russian national junior team at several tournaments, winning a silver and bronze medal in consecutive World Junior Championships.', 'title': 'Ivan Barbashev'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'Brendan Perlini (born April 27, 1996) is an English born Canadian ice hockey forward. He is currently playing for the Arizona Coyotes of the National Hockey League (NHL). Perlini was selected by the Arizona Coyotes in the first round (12th overall) of the 2014 NHL Entry Draft. Born in the United Kingdom where his father, Fred Perlini, played hockey, Perlini grew up there before returning to Canada with his family in 2007. He spent four seasons in the major junior Ontario Hockey League, and made his NHL debut with the Coyotes in 2016. Internationally Perlini has played for the Canadian national junior team, and won a bronze medal at the 2014 World Under-18 Championship.', 'title': 'Brendan Perlini'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': 'Oscar Dansk (born February 28, 1994) is a Swedish ice hockey goaltender currently playing with the Chicago Wolves in the American Hockey League (AHL) as a prospect to the Vegas Golden Knights of the National Hockey League (NHL). Dansk was drafted by the Columbus Blue Jackets at the 2012 NHL Entry Draft with the 31st overall pick, the first pick of the second round. He was the starting goaltender for the Swedish national junior team at the 2014 World Junior Ice Hockey Championships.', 'title': 'Oscar Dansk'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The 2016 IIHF World Junior Championship was the 40th World Junior Ice Hockey Championship. It was hosted in Helsinki, Finland. It began on December 26, 2015, and ended with the gold medal game on January 5, 2016. This marked the sixth time that Finland has hosted the WJC, and the hosts defeated Russia 4–3 in overtime to win their fourth title in history and second in the last three years. Belarus was relegated to Division I-A for 2017 by merit of their tenth-place finish, while Finnish right winger Jesse Puljujärvi earned MVP and top scorer honors.', 'title': '2016 World Junior Ice Hockey Championships'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'Brock Boeser ( ; ] ; born February 25, 1997) is an American ice hockey player currently playing for the Vancouver Canucks of the National Hockey League (NHL). A top prospect with the Waterloo Black Hawks of the United States Hockey League (USHL), Boeser was selected 23rd overall in the 2015 NHL Entry Draft by the Canucks, and spent the following two seasons with the University of North Dakota. He made his NHL debut in 2017 with Vancouver. Internationally Boeser has played for the United States national junior team at the 2016 World Junior Championships, where he helped the team win a bronze medal.', 'title': 'Brock Boeser'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': 'Nail Railovich Yakupov (Russian: Наиль Раилович Якупов , Tatar: Наил Раил улы Якупов , "Nail Rail ulı Yakupov " ; born 6 October 1993) is a Russian professional ice hockey player who is currently playing for the Colorado Avalanche of the National Hockey League. He was selected first overall by the Edmonton Oilers at the 2012 NHL Entry Draft. Yakupov grew up within the HC Neftekhimik Nizhnekamsk junior program and moved to North America in 2010 to further his career. He joined the Sarnia Sting, a major junior team in the Ontario Hockey League (OHL), where he played for two years before being selected in the NHL Entry Draft. Yakupov played for the Russian national junior team, winning medals in all three tournaments he participated in.', 'title': 'Nail Yakupov'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ryan Johansen (born July 31, 1992) is a Canadian professional ice hockey centre, an alternate captain for the Nashville Predators of the National Hockey League (NHL). Growing up, he played minor hockey in the Greater Vancouver area until joining the junior ranks with the Penticton Vees of the British Columbia Hockey League (BCHL) for one season. In 2009–10, he moved to the major junior level with the Portland Winterhawks of the Western Hockey League (WHL). After his first WHL season, he was selected fourth overall by the Blue Jackets in the 2010 NHL Entry Draft. Internationally, he has competed for the Canadian national junior team at the 2011 World Junior Ice Hockey Championships, where he earned a silver medal and was named to the Tournament All-Star Team. In 2015, he participated in the 2015 NHL Skills Competition and was named the 2015 NHL All-Star Game MVP.', 'title': 'Ryan Johansen'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Matthew Stajan ( ; born December 19, 1983) is a Canadian professional ice hockey centre currently playing for the Calgary Flames of the National Hockey League (NHL). He was a second round selection, 57th overall, of the Toronto Maple Leafs at the 2002 NHL Entry Draft. Stajan made his NHL debut in 2004 and was a member of the Maple Leafs until he was traded to Calgary in 2010. Internationally, Stajan was a member of the Canadian national junior team that won a silver medal at the 2003 World Junior Hockey Championships.', 'title': 'Matt Stajan'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': "MacKenzie Blackwood (born December 9, 1996) is a Canadian professional ice hockey goaltender. He is currently playing with the Binghamton Devils in the American Hockey League (AHL) as a prospect of the New Jersey Devils of the National Hockey League (NHL). Blackwood was the top-rated North American goaltender ranked in the NHL Central Scouting Bureau's final rankings for the 2015 NHL Entry Draft. He was taken by the Devils in the 2nd round, 42nd overall, in the 2015 NHL Entry Draft.", 'title': 'Mackenzie Blackwood'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'Casanova Wong, also known as Ka Sat Fat (卡薩伐), is a former Korean martial arts actor born in 1945 as Yong-ho Kim in Gimje, South Korea. An expert in tae kwon do, he is a leg-fighter, and is well known for his spin kicks and was nicknamed "The Human Tornado" in the Republic of Korea Army. He made many appearances in martial arts movies but is most remembered for his role as Cashier Hua in "Warriors Two", where he starred alongside Sammo Hung, with whom he worked several times. Other films included "Story of Drunken Master" and "Rivals of the Silver Fox". One of Wong\'s last notable movie appearances was as Kang-ho in the 1994 Korean movie "Bloody Mafia".', 'title': 'Casanova Wong'}
