 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'Ion Popescu-Gopo (] ; 1 May 1923, Roești, Vâlcea – 28 November 1989, Bucharest) was a Romanian graphic artist and animator, but also writer, movie director and actor born in Bucharest, Romania. He was a prominent personality in the Romanian cinematography and the founder of the modern Romanian cartoon school. He was, together with Liviu Ciulei and Mirel Ilieşiu one of the few Romanian film artists who won an award at Cannes in the 20th century. His film "Scurtă Istorie" ("A Brief History") won the "Short Film Palme d\'Or" for best short film in 1957. His 1965 film "The White Moor" was entered into the 4th Moscow International Film Festival where he won the award for Best Director. In 1969 he was a member of the jury at the 6th Moscow International Film Festival. In 1977 he was a member of the jury at the 10th Moscow International Film Festival. In 1983 he was a member of the jury at the 13th Moscow International Film Festival.', 'title': 'Ion Popescu-Gopo'}
