 {'idx': 4, 'is_supporting': False, 'paragraph_text': 'Retail leakage occurs when local people are spending more for goods, than local businesses sell, usually due to people traveling to a neighboring town to buy goods. Retail sales leakage occurs when there is unsatisfied demand within the trading area and that the locality should provide extra stores spaces for such type of businesses. After all, retail leakage does not necessarily translate into opportunity. For instance, there could be a tough competition in a nearby locality that leads the market for same type of product. Many small - to medium-sized communities experience leakage of retail expenditures as local citizens drive to neighboring towns to shop at national retail chains (e.g. Tesco, Asda) or eat at national restaurant chains (e.g. Slug and Lettuce, Harvester). Attracting such national retail chain stores and restaurants to a community can prevent this type of expenditure leakage and create local jobs.', 'title': 'Leakage (retail)'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'Arvanitidis (Greek: Αρβανιτίδης ) was a regional Greek supermarket chain situated in northern Greece. The company was established in 1950 by N. Arvanitidis initially as a wholesaler. In 1986 Arvanitidis opened its first supermarket in Veria. As of January 2012, the company has a total of 163 stores, the majority of which are located in northern Greece. Arvanitidis is the second biggest regional grocery retail chain in Greece. The company belongs to the Arvanitidis family. In 2013, a scandal broke out, bringing the retail chain to sell products that were produced in its storehouses under the name of famous brands.', 'title': 'Super-Markets Arvanitidis'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "Chain store(s) or retail chain are retail outlets that share a brand and central management, and usually have standardized business methods and practices. In retail, dining, and many service categories, chain businesses have come to dominate the market in many parts of the world. A franchise retail establishment is one form of chain store. In 2004, the world's largest retail chain, Wal-Mart, became the world's largest corporation based on gross sales.", 'title': 'Chain store'}
 {'idx': 7, 'is_supporting': True, 'paragraph_text': 'B&M European Retail Value S.A. (also known as B&M Bargains and the larger B&M Homestore) was formed in 1978 and is now one of the leading variety retailers in the United Kingdom, employing over 22,500 staff. It is listed on the London Stock Exchange, and is a constituent of the FTSE 250 Index.', 'title': 'B &amp; M'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': "Sears Canada is a Canadian retail chain headquartered in Toronto, Ontario. The company's roots are in Simpsons-Sears, a joint venture with the Simpsons retail chain and the U.S. Sears chain, which operated a national mail order business, and co-branded Simpsons-Sears stores modelled after the U.S. Sears chain. Following the purchase of Simpsons by the Hudson's Bay Company in 1978, the joint venture was dismantled, and the Simpsons-Sears stores became solely owned by Sears. In 1999, Sears Canada acquired the remaining assets and locations of the historic Canadian chain Eaton's. Sears Holdings now owns a 10% share in the company. ESL Investments is the largest shareholder of Sears Canada.", 'title': 'Sears Canada'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Simon Arora (born November 1969) is a British billionaire businessman, CEO of the retail chain B & M.', 'title': 'Simon Arora'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': "WGPB FM 97.7 is a public radio station in Rome, Georgia. It is part of the Georgia Public Broadcasting radio network, a state network which in turn is a member of National Public Radio, Public Radio International, and American Public Media. Unlike most stations on the GPB network, WGPB does not completely simulcast with the network. WGPB also produces its own programs. The studios are located at Georgia Highlands College's Heritage Hall campus in downtown Rome, from which locally produced programming originates. The station began broadcasting as WGPB at 5 AM on June 30, 2006.", 'title': 'WGPB'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Steve Robinson (born September 7, 1946) is an American radio manager, producer and executive producer. He has held senior management positions with numerous American radio stations, including WFMT and the WFMT Radio Network/Chicago, WBUR/Boston, WGBH/Boston, WCRB/Boston, KPFA/Berkeley, WBGO/Newark, Vermont Public Radio and Nebraska Public Radio Network.ork. Robinson served as general manager of the statewide Nebraska Public Radio Network (1990-2000) and WFMT and the WFMT Radio Network from 2000 until October 2016.', 'title': 'Steve Robinson (executive)'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'KCND (90.5 FM) is a public radio station licensed to Bismarck. It signed on the air in 1981 as Prairie Public Radio, which later became part of the statewide North Dakota Public Radio network, the entirety of which was later renamed Prairie Public Radio. It currently broadcasts with an effective radiated power of 50\xa0kW on 90.5\xa0MHz.', 'title': 'KCND'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': "The New Jersey Network (NJN) was a network of public television and radio stations serving the U.S. state of New Jersey. NJN was a member of the Public Broadcasting Service (PBS) for television and the National Public Radio (NPR) for radio, broadcasting their programming as well as producing and broadcasting their own programming, mostly relating to issues in New Jersey. With studios in both Trenton and Newark, NJN's television network covered all of New Jersey, plus parts of Pennsylvania, New York, Connecticut and Delaware; the radio network primarily served several areas of New Jersey that were not covered by Philadelphia and New York City public radio stations.", 'title': 'New Jersey Network'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'Eric M. Plakun, MD, DLFAPA, FACPsych, is an American board certified psychiatrist, psychoanalyst, researcher and forensic psychiatrist. He is the current associate medical director and director of biopsychosocial advocacy at the Austen Riggs Center in Stockbridge, MA. Plakun’s primary interests include the value of and evidence base for psychosocial treatments and the diagnosis, treatment, longitudinal course and outcome of patients with borderline personality disorder and treatment resistant disorders. Plakun has been widely published and quoted in the media on psychotherapy and psychiatry, including in The New York Times and The Globe and Mail. He has appeared in the media to discuss his psychiatric work on WAMC, the Albany, New York affiliate of NPR. and on CBS 60 Minutes. His psychiatric research has been widely cited.', 'title': 'Eric Plakun'}
 {'idx': 5, 'is_supporting': False, 'paragraph_text': 'WPPR (88.3) is a public radio station in Demorest, Georgia. Originally, WPPR had the call letters WDEM (Radio Demorest), but changed to WPPR on August 19, 1996. It is part of the Georgia Public Broadcasting radio network, which in turn is a member of National Public Radio, Public Radio International, and American Public Media. Unlike many stations of the GPB network, WPPR does not only broadcast simulcasts from GPB. WPPR also produces its own programming about the local area including Habersham County. One of the community features, "Community Life in Northeast Georgia," is an educational and informative program about an area that is not well known. WPPR\'s studios are located on the Piedmont College campus in Demorest. This allows for Piedmont Mass Communications students to work directly with WPPR as interns.', 'title': 'WPPR'}
 {'idx': 6, 'is_supporting': True, 'paragraph_text': 'WAMC is a public radio network headquartered in Albany, New York. The network has 12 broadcast radio stations (transmitters) and 16 broadcast relay stations (translators,repeaters). One of the stations is an AM station: WAMC (AM) 1400 in Albany. The organization\'s legal name is "WAMC" and it is also known as "WAMC Public Radio" or "WAMC Northeast Public Radio."', 'title': 'WAMC'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': "AMPERS (Association of Minnesota Public Educational Radio Stations) is a public radio network in Minnesota. It is the second-largest public radio organization in the state, after Minnesota Public Radio (MPR). Known as Independent Public Radio (IPR) between 2004 and 2012, the network helps member stations coordinate fundraising and allows them to share a certain amount of programming. A number of AMPERS' 12 members are college radio stations. The network headquarters is located at 525 Park Street, Suite 310, St. Paul, MN.", 'title': 'AMPERS'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'KMXT is a non-commercial radio station in Kodiak, Alaska, broadcasting on 100.1 FM. The station airs public radio programming from the National Public Radio network, Alaska Public Radio Network and the BBC World Service. KMXT also airs many hours of locally originated news, talk and music programming, and relies heavily on non-paid citizen volunteers to host numerous shows.', 'title': 'KMXT (FM)'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'Minnesota Public Radio (MPR), is a public radio network for the state of Minnesota. With its three services, News & Information, Classical Music and The Current, MPR operates a 44-station regional radio network in the upper Midwest serving over 9 million people. MPR has 127,150 members and more than one million listeners each week, the largest audience of any regional public radio network.', 'title': 'Minnesota Public Radio'}]

[{'idx': 0, 'is_supporting': False, 'paragraph_text': 'The French St. Étienne Mle 1907 (French: "Mitrailleuse Mle 1907 T" ) was a gas operated air-cooled machine gun in 8mm Lebel which was widely used in the early years of the First World War. The "St.Etienne Mle 1907" was not derived from the Hotchkiss machine gun. Instead it was an entirely different gas operated blow-forward design borrowed from the semi-automatic Bang rifle of 1903. This Bang system was first transposed in 1905 to the French Puteaux APX Machine Gun which soon proved to be unsatisfactory. Then, two years later, the Mle 1907 "St-Etienne" machine gun followed as an improved redesign of the "Puteaux" machine gun. However the Mle 1907 "Saint Etienne" was only a partial redesign : the original blow-forward gas piston, rack-and-pinion system, and bolt mechanism of the Mle 1905 " Puteaux" machine gun had all been kept only slightly modified inside the newer weapon. Eventually a total of over 39,700 "St-Etienne" Mle 1907 machine guns were manufactured between 1908 and late 1917. They were widely used by French infantry during the early part of World War I until their replacement by the distinctly more reliable Hotchkiss M1914 machine-gun.', 'title': 'St. Étienne Mle 1907'}
 {'idx': 1, 'is_supporting': False, 'paragraph_text': 'Karabin maszynowy wz. 36, also known as Karabin lotniczy uniwersalny wz. 36 (Polish: "Machine gun Mark 1936" and Polish: "Aerial Universal Machine Gun" , respectively) was a Polish 7.9 mm calibre aerial machine gun of the 1930s. It was a further modified version of Karabin maszynowy wz. 33, itself a modification of the successful Ckm wz.30 multi-purpose HMG.', 'title': 'Karabin maszynowy wz. 36'}
 {'idx': 2, 'is_supporting': False, 'paragraph_text': 'The Type 97 heavy tank machine gun (九七式車載重機関銃 , Kyū-nana-shiki shasai jū-kikanjū ) was the standard machine gun used in tanks and armored vehicles of the Imperial Japanese Army during World War II, a heavy machine gun by infantry forces, This weapon was not related to the Type 97 aircraft machine gun used in several Japanese Navy aircraft including the A6M Zero.', 'title': 'Type 97 heavy tank machine gun'}
 {'idx': 3, 'is_supporting': False, 'paragraph_text': '4TP, otherwise known as PZInż 140, was a Polish light tank prototype. It was designed by 16 December 1936 by Edward Habich of the Państwowe Zakłady Inżynieryjne works. A light reconnaissance tank, it was to become a heavier replacement for TK-3 and TKS tankettes in Polish service. In addition to light, manoeuvrable chassis, the tank was to feature a turret with one 20 mm nkm wz. 38 FK autocannon and one Ckm wz. 30 machine gun.', 'title': '4TP'}
 {'idx': 4, 'is_supporting': True, 'paragraph_text': 'The Ciężki karabin maszynowy wz. 25 Hotchkiss (Polish for "Heavy machine gun, Mark 1925, Hotchkiss") was a Polish derivative of the Hotchkiss M1914 machine gun, rechambered for 7.92×57mm Mauser ammunition.', 'title': 'Ckm wz. 25 Hotchkiss'}
 {'idx': 5, 'is_supporting': True, 'paragraph_text': 'The Mle 1914 Hotchkiss machine gun chambered for the 8mm Lebel cartridge became the standard machine gun of the French Army during World War I. It was manufactured by the French arms company Hotchkiss et Cie, which had been established in the 1860s by American industrialist Benjamin B. Hotchkiss. The gas-actuated Hotchkiss system was first formulated in 1895 by Odkolek von Ujezda and improved into its final form by Hotchkiss armament engineers Laurence Benét and Henri Mercié.', 'title': 'Hotchkiss M1914 machine gun'}
 {'idx': 6, 'is_supporting': False, 'paragraph_text': "The Canadian Machine Gun Corps (CMGC) was an administrative corps of the Canadian Army. It was part of the Canadian Expeditionary Force sent to France during World War I. The Canadian Permanent Machine Gun Brigade was organized in the Permanent Force on 3 November 1919. The Canadian Permanent Machine Gun Brigade was redesignated the Royal Canadian Permanent Machine Gun Brigade on 16 June 1921. The Royal Canadian Permanent Machine Gun Brigade was disbanded on 1 November 1923. The Canadian Machine Gun Corps donated a wall plaque at St. George's Church in Ypres.", 'title': 'Canadian Machine Gun Corps'}
 {'idx': 7, 'is_supporting': False, 'paragraph_text': 'The Polish Infantry Regiment during World War 2 (in Polish Pulk Piechoty) comprised on average some 2,900 men and 60 officers organised around 3 rifle battalions armed with the Mauser 98k 7.92mm bolt-action rifle. Each 19-man squad was also issued the RKM wz.28 light machine gun. Other regimental weapons included the Polish version of the French Model 1897 75-mm field gun, the Wz. 35 anti-tank rifle, the Ckm wz.30 heavy machine gun, the wz.31 81\xa0mm mortar, and the wz.36 46mm light mortar/grenade launcher.', 'title': '1939 Infantry Regiment (Poland)'}
 {'idx': 8, 'is_supporting': False, 'paragraph_text': 'Ckm wz. 30 (short for "ciężki karabin maszynowy wz. 30"; "heavy machine gun 1930 Pattern") is a Polish-made clone of the American Browning M1917 heavy machine gun. Produced with various modifications such as greater caliber, longer barrel and adjustable sighting device, it was an improved although unlicensed copy of its predecessor, and was the standard machine gun of the Polish Army since 1931.', 'title': 'Ckm wz. 30'}
 {'idx': 9, 'is_supporting': False, 'paragraph_text': 'The M2 Machine Gun or Browning .50 Caliber Machine Gun is a heavy machine gun designed toward the end of World War I by John Browning. Its design is similar to Browning\'s earlier M1919 Browning machine gun, which was chambered for the .30-06 cartridge. The M2 uses the much larger and much more powerful .50 BMG cartridge, which was developed alongside and takes its name from the gun itself (BMG standing for "Browning Machine Gun"). It has been referred to as "Ma Deuce", in reference to its M2 nomenclature. The design has had many specific designations; the official designation for the current infantry type is Browning Machine Gun, Cal. .50, M2, HB, Flexible. It is effective against infantry, unarmored or lightly armored vehicles and boats, light fortifications and low-flying aircraft. The M2 has been produced longer than any other machine gun.', 'title': 'M2 Browning'}]
